(255, 'Abortive', 'n.', 'A medicine to which is attributed the property of causing\n   abortion.'),
(256, 'Abought', '', 'imp. & p. p. of Aby.'),
(257, 'Abounded', 'imp. & p. p.', 'of Abound'),
(258, 'Abound', 'v. i.', 'To be in great plenty; to be very prevalent; to be\n   plentiful.'),
(259, 'Abound', 'v. i.', 'To be copiously supplied; -- followed by in or with.'),
(260, 'About', 'prep.', 'Around; all round; on every side of.'),
(261, 'About', 'prep.', 'In the immediate neighborhood of; in contiguity or\n   proximity to; near, as to place; by or on (one\'s person).'),
(262, 'About', 'prep.', 'Over or upon different parts of; through or over in\n   various directions; here and there in; to and fro in; throughout.'),
(263, 'About', 'prep.', 'Near; not far from; -- determining approximately time,\n   size, quantity.'),
(264, 'About', 'prep.', 'In concern with; engaged in; intent on.'),
(265, 'About', 'prep.', 'On the point or verge of; going; in act of.'),
(266, 'About', 'prep.', 'Concerning; with regard to; on account of; touching.'),
(267, 'About', 'adv.', 'On all sides; around.'),
(268, 'About', 'adv.', 'In circuit; circularly; by a circuitous way; around the\n   outside; as, a mile about, and a third of a mile across.'),
(269, 'About', 'adv.', 'Here and there; around; in one place and another.'),
(270, 'About', 'adv.', 'Nearly; approximately; with close correspondence, in\n   quality, manner, degree, etc.; as, about as cold; about as high; --\n   also of quantity, number, time.'),
(271, 'About', 'adv.', 'To a reserved position; half round; in the opposite\n   direction; on the opposite tack; as, to face about; to turn one\'s self\n   about.'),
(272, 'Above', 'prep.', 'In or to a higher place; higher than; on or over the\n   upper surface; over; -- opposed to below or beneath.'),
(273, 'Above', 'prep.', 'Figuratively, higher than; superior to in any respect;\n   surpassing; beyond; higher in measure or degree than; as, things above\n   comprehension; above mean actions; conduct above reproach.'),
(274, 'Above', 'prep.', 'Surpassing in number or quantity; more than; as, above a\n   hundred. (Passing into the adverbial sense. See Above, adv., 4.)'),
(275, 'Above', 'adv.', 'In a higher place; overhead; into or from heaven; as, the\n   clouds above.'),
(276, 'Above', 'adv.', 'Earlier in order; higher in the same page; hence, in a\n   foregoing page.'),
(277, 'Above', 'adv.', 'Higher in rank or power; as, he appealed to the court\n   above.'),
(278, 'Above', 'adv.', 'More than; as, above five hundred were present.'),
(279, 'Abradant', 'n.', 'A material used for grinding, as emery, sand, powdered\n   glass, etc.'),
(280, 'Abraded', 'imp. & p. p.', 'of Abrade'),
(281, 'Abrading', 'p. pr. & vb. n.', 'of Abrade'),
(282, 'Abrade', 'v. t.', 'To rub or wear off; to waste or wear away by friction;\n   as, to abrade rocks.'),
(283, 'Abrade', 'v. t.', 'Same as Abraid.'),
(284, 'Abraid', 'v. t. & i.', 'To awake; to arouse; to stir or start up; also, to\n   shout out.'),
(285, 'Abrase', 'a.', 'Rubbed smooth.'),
(286, 'Abrasion', 'n.', 'The act of abrading, wearing, or rubbing off; the wearing\n   away by friction; as, the abrasion of coins.'),
(287, 'Abrasion', 'n.', 'The substance rubbed off.'),
(288, 'Abrasion', 'n.', 'A superficial excoriation, with loss of substance under\n   the form of small shreds.'),
(289, 'Abrasive', 'a.', 'Producing abrasion.'),
(290, 'Abraum', 'n.', 'Alt. of Abraum salts'),
(291, 'Abraxas', 'n.', 'A mystical word used as a charm and engraved on gems among\n   the ancients; also, a gem stone thus engraved.'),
(292, 'Abray', 'v.', 'See Abraid.'),
(293, 'Abreast', 'adv.', 'Side by side, with breasts in a line; as, \"Two men could\n   hardly walk abreast.\"'),
(294, 'Abreast', 'adv.', 'Side by side; also, opposite; over against; on a line\n   with the vessel\'s beam; -- with of.'),
(295, 'Abreast', 'adv.', 'Up to a certain level or line; equally advanced; as, to\n   keep abreast of [or with] the present state of science.'),
(296, 'Abreast', 'adv.', 'At the same time; simultaneously.'),
(297, 'Abregge', 'v. t.', 'See Abridge.'),
(298, 'Abricock', 'n.', 'See Apricot.'),
(299, 'Abridged', 'imp. & p. p.', 'of Abridge'),
(300, 'Abridge', 'v. t.', 'To make shorter; to shorten in duration; to lessen; to\n   diminish; to curtail; as, to abridge labor; to abridge power or rights.'),
(301, 'Abridge', 'v. t.', 'To shorten or contract by using fewer words, yet\n   retaining the sense; to epitomize; to condense; as, to abridge a\n   history or dictionary.'),
(302, 'Abridge', 'v. t.', 'To deprive; to cut off; -- followed by of, and formerly\n   by from; as, to abridge one of his rights.'),
(303, 'Abridger', 'n.', 'One who abridges.'),
(304, 'Abroach', 'v. t.', 'To set abroach; to let out, as liquor; to broach; to\n   tap.'),
(305, 'Abroach', 'adv.', 'Broached; in a condition for letting out or yielding\n   liquor, as a cask which is tapped.'),
(306, 'Abroach', 'adv.', 'Hence: In a state to be diffused or propagated; afoot;\n   astir.'),
(307, 'Abroad', 'adv.', 'At large; widely; broadly; over a wide space; as, a tree\n   spreads its branches abroad.'),
(308, 'Abroad', 'adv.', 'Without a certain confine; outside the house; away from\n   one\'s abode; as, to walk abroad.'),
(309, 'Abroad', 'adv.', 'Beyond the bounds of a country; in foreign countries; as,\n   we have broils at home and enemies abroad.'),
(310, 'Abroad', 'adv.', 'Before the public at large; throughout society or the\n   world; here and there; widely.'),
(311, 'Abrogate', 'a.', 'Abrogated; abolished.'),
(312, 'Abrogate', 'v. t.', 'To annul by an authoritative act; to abolish by the\n   authority of the maker or his successor; to repeal; -- applied to the\n   repeal of laws, decrees, ordinances, the abolition of customs, etc.'),
(313, 'Abrogate', 'v. t.', 'To put an end to; to do away with.'),
(314, 'Abrood', 'adv.', 'In the act of brooding.'),
(315, 'Abrook', 'v. t.', 'To brook; to endure.'),
(316, 'Abrupt', 'a.', 'Broken off; very steep, or craggy, as rocks, precipices,\n   banks; precipitous; steep; as, abrupt places.'),
(317, 'Abrupt', 'a.', 'Without notice to prepare the mind for the event; sudden;\n   hasty; unceremonious.'),
(318, 'Abrupt', 'a.', 'Having sudden transitions from one subject to another;\n   unconnected.'),
(319, 'Abrupt', 'a.', 'Suddenly terminating, as if cut off.'),
(320, 'Abrupt', 'n.', 'An abrupt place.'),
(321, 'Abrupt', 'v. t.', 'To tear off or asunder.'),
(322, 'Abruptly', 'adv.', 'In an abrupt manner; without giving notice, or without\n   the usual forms; suddenly.'),
(323, 'Abruptly', 'adv.', 'Precipitously.'),
(324, 'Abscess', 'n.', 'A collection of pus or purulent matter in any tissue or\n   organ of the body, the result of a morbid process.'),
(325, 'Abscind', 'v. t.', 'To cut off.'),
(326, 'Absciss', 'n.', 'See Abscissa.'),
(327, 'Abscissa', 'n.', 'One of the elements of reference by which a point, as of\n   a curve, is referred to a system of fixed rectilineal coordinate axes.'),
(328, 'Abscond', 'v. i.', 'To hide, withdraw, or be concealed.'),
(329, 'Abscond', 'v. i.', 'To depart clandestinely; to steal off and secrete one\'s\n   self; -- used especially of persons who withdraw to avoid a legal\n   process; as, an absconding debtor.'),
(330, 'Abscond', 'v. t.', 'To hide; to conceal.'),
(331, 'Absence', 'n.', 'A state of being absent or withdrawn from a place or from\n   companionship; -- opposed to presence.'),
(332, 'Absence', 'n.', 'Want; destitution; withdrawal.'),
(333, 'Absence', 'n.', 'Inattention to things present; abstraction (of mind); as,\n   absence of mind.'),
(334, 'Absent', 'a.', 'Being away from a place; withdrawn from a place; not\n   present.'),
(335, 'Absent', 'a.', 'Not existing; lacking; as, the part was rudimental or\n   absent.'),
(336, 'Absent', 'a.', 'Inattentive to what is passing; absent-minded; preoccupied;\n   as, an absent air.'),
(337, 'Absented', 'imp. & p. p.', 'of Absent'),
(338, 'Absent', 'v. t.', 'To take or withdraw (one\'s self) to such a distance as\n   to prevent intercourse; -- used with the reflexive pronoun.'),
(339, 'Absent', 'v. t.', 'To withhold from being present.'),
(340, 'Absentee', 'n.', 'One who absents himself from his country, office, post,\n   or duty; especially, a landholder who lives in another country or\n   district than that where his estate is situated; as, an Irish absentee.'),
(341, 'Absenter', 'n.', 'One who absents one\'s self.'),
(342, 'Absently', 'adv.', 'In an absent or abstracted manner.'),
(343, 'Absinth', 'n.', 'Alt. of Absinthe'),
(344, 'Absinthe', 'n.', 'The plant absinthium or common wormwood.'),
(345, 'Absinthe', 'n.', 'A strong spirituous liqueur made from wormwood and brandy\n   or alcohol.'),
(346, 'Absis', 'n.', 'See Apsis.'),
(347, 'Absist', 'v. i.', 'To stand apart from; top leave off; to desist.'),
(348, 'Absolute', 'a.', 'Loosed from any limitation or condition; uncontrolled;\n   unrestricted; unconditional; as, absolute authority, monarchy,\n   sovereignty, an absolute promise or command; absolute power; an\n   absolute monarch.'),
(349, 'Absolute', 'a.', 'Complete in itself; perfect; consummate; faultless; as,\n   absolute perfection; absolute beauty.'),
(350, 'Absolute', 'a.', 'Viewed apart from modifying influences or without\n   comparison with other objects; actual; real; -- opposed to relative and\n   comparative; as, absolute motion; absolute time or space.'),
(351, 'Absolute', 'a.', 'Loosed from, or unconnected by, dependence on any other\n   being; self-existent; self-sufficing.'),
(352, 'Absolute', 'a.', 'Capable of being thought or conceived by itself alone;\n   unconditioned; non-relative.'),
(353, 'Absolute', 'a.', 'Positive; clear; certain; not doubtful.'),
(354, 'Absolute', 'a.', 'Authoritative; peremptory.'),
(355, 'Absolute', 'a.', 'Pure; unmixed; as, absolute alcohol.'),
(356, 'Absolute', 'a.', 'Not immediately dependent on the other parts of the\n   sentence in government; as, the case absolute. See Ablative absolute,\n   under Ablative.'),
(357, 'Absolute', 'n.', 'In a plane, the two imaginary circular points at\n   infinity; in space of three dimensions, the imaginary circle at\n   infinity.'),
(358, 'Absolved', 'imp. & p. p.', 'of Absolve'),
(359, 'Absolve', 'v. t.', 'To set free, or release, as from some obligation, debt,\n   or responsibility, or from the consequences of guilt or such ties as it\n   would be sin or guilt to violate; to pronounce free; as, to absolve a\n   subject from his allegiance; to absolve an offender, which amounts to\n   an acquittal and remission of his punishment.'),
(360, 'Absolve', 'v. t.', 'To free from a penalty; to pardon; to remit (a sin); --\n   said of the sin or guilt.'),
(361, 'Absolve', 'v. t.', 'To finish; to accomplish.'),
(362, 'Absolve', 'v. t.', 'To resolve or explain.'),
(363, 'Absolver', 'n.', 'One who absolves.'),
(364, 'Absonant', 'a.', 'Discordant; contrary; -- opposed to consonant.'),
(365, 'Absonous', 'a.', 'Discordant; inharmonious; incongruous.'),
(366, 'Absorbed', 'imp. & p. p.', 'of Absorb'),
(367, 'Absorb', 'v. t.', 'To swallow up; to engulf; to overwhelm; to cause to\n   disappear as if by swallowing up; to use up; to include.'),
(368, 'Absorb', 'v. t.', 'To suck up; to drink in; to imbibe; as a sponge or as\n   the lacteals of the body.'),
(369, 'Absorb', 'v. t.', 'To engross or engage wholly; to occupy fully; as,\n   absorbed in study or the pursuit of wealth.'),
(370, 'Absorb', 'v. t.', 'To take up by cohesive, chemical, or any molecular\n   action, as when charcoal absorbs gases. So heat, light, and electricity\n   are absorbed or taken up in the substances into which they pass.'),
(371, 'Absorber', 'n.', 'One who, or that which, absorbs.'),
(372, 'Absorpt', 'a.', 'Absorbed.'),
(373, 'Abstain', 'v. i.', 'To hold one\'s self aloof; to forbear or refrain\n   voluntarily, and especially from an indulgence of the passions or\n   appetites; -- with from.'),
(374, 'Abstain', 'v. t.', 'To hinder; to withhold.'),
(375, 'Absterge', 'v. t.', 'To make clean by wiping; to wipe away; to cleanse;\n   hence, to purge.'),
(376, 'Absterse', 'v. t.', 'To absterge; to cleanse; to purge away.'),
(377, 'Abstract', 'a.', 'Withdraw; separate.'),
(378, 'Abstract', 'a.', 'Considered apart from any application to a particular\n   object; separated from matter; existing in the mind only; as, abstract\n   truth, abstract numbers. Hence: ideal; abstruse; difficult.'),
(379, 'Abstract', 'a.', 'Expressing a particular property of an object viewed\n   apart from the other properties which constitute it; -- opposed to\n   concrete; as, honesty is an abstract word.'),
(380, 'Abstract', 'a.', 'Resulting from the mental faculty of abstraction; general\n   as opposed to particular; as, \"reptile\" is an abstract or general name.'),
(381, 'Abstract', 'a.', 'Abstracted; absent in mind.'),
(382, 'Abstract', 'a.', 'To withdraw; to separate; to take away.'),
(383, 'Abstract', 'a.', 'To draw off in respect to interest or attention; as, his\n   was wholly abstracted by other objects.'),
(384, 'Abstract', 'a.', 'To separate, as ideas, by the operation of the mind; to\n   consider by itself; to contemplate separately, as a quality or\n   attribute.'),
(385, 'Abstract', 'a.', 'To epitomize; to abridge.'),
(386, 'Abstract', 'a.', 'To take secretly or dishonestly; to purloin; as, to\n   abstract goods from a parcel, or money from a till.'),
(387, 'Abstract', 'a.', 'To separate, as the more volatile or soluble parts of a\n   substance, by distillation or other chemical processes. In this sense\n   extract is now more generally used.'),
(388, 'Abstract', 'v. t.', 'To perform the process of abstraction.'),
(389, 'Abstract', 'a.', 'That which comprises or concentrates in itself the\n   essential qualities of a larger thing or of several things.\n   Specifically: A summary or an epitome, as of a treatise or book, or of\n   a statement; a brief.'),
(390, 'Abstract', 'a.', 'A state of separation from other things; as, to consider\n   a subject in the abstract, or apart from other associated things.'),
(391, 'Abstract', 'a.', 'An abstract term.'),
(392, 'Abstract', 'a.', 'A powdered solid extract of a vegetable substance mixed\n   with sugar of milk in such proportion that one part of the abstract\n   represents two parts of the original substance.'),
(393, 'Abstrude', 'v. t.', 'To thrust away.'),
(394, 'Abstruse', 'a.', 'Concealed or hidden out of the way.'),
(395, 'Abstruse', 'a.', 'Remote from apprehension; difficult to be comprehended or\n   understood; recondite; as, abstruse learning.'),
(396, 'Absume', 'v. t.', 'To consume gradually; to waste away.'),
(397, 'Absurd', 'a.', 'Contrary to reason or propriety; obviously and fiatly\n   opposed to manifest truth; inconsistent with the plain dictates of\n   common sense; logically contradictory; nonsensical; ridiculous; as, an\n   absurd person, an absurd opinion; an absurd dream.'),
(398, 'Absurd', 'n.', 'An absurdity.'),
(399, 'Absurdly', 'adv.', 'In an absurd manner.'),
(400, 'Abuna', 'n.', 'The Patriarch, or head of the Abyssinian Church.'),
(401, 'Abundant', 'a.', 'Fully sufficient; plentiful; in copious supply; --\n   followed by in, rarely by with.'),
(402, 'Aburst', 'adv.', 'In a bursting condition.'),
(403, 'Abusable', 'a.', 'That may be abused.'),
(404, 'Abusage', 'n.', 'Abuse.'),
(405, 'Abused', 'imp. & p. p.', 'of Abuse'),
(406, 'Abusing', 'p. pr. & vb. n.', 'of Abuse'),
(407, 'Abuse', 'v. t.', 'To put to a wrong use; to misapply; to misuse; to put to\n   a bad use; to use for a wrong purpose or end; to pervert; as, to abuse\n   inherited gold; to make an excessive use of; as, to abuse one\'s\n   authority.'),
(408, 'Abuse', 'v. t.', 'To use ill; to maltreat; to act injuriously to; to punish\n   or to tax excessively; to hurt; as, to abuse prisoners, to abuse one\'s\n   powers, one\'s patience.'),
(409, 'Abuse', 'v. t.', 'To revile; to reproach coarsely; to disparage.'),
(410, 'Abuse', 'v. t.', 'To dishonor.'),
(411, 'Abuse', 'v. t.', 'To violate; to ravish.'),
(412, 'Abuse', 'v. t.', 'To deceive; to impose on.'),
(413, 'Abuse', 'v. t.', 'Improper treatment or use; application to a wrong or bad\n   purpose; misuse; as, an abuse of our natural powers; an abuse of civil\n   rights, or of privileges or advantages; an abuse of language.'),
(414, 'Abuse', 'v. t.', 'Physical ill treatment; injury.'),
(415, 'Abuse', 'v. t.', 'A corrupt practice or custom; offense; crime; fault; as,\n   the abuses in the civil service.'),
(416, 'Abuse', 'v. t.', 'Vituperative words; coarse, insulting speech; abusive\n   language; virulent condemnation; reviling.'),
(417, 'Abuse', 'v. t.', 'Violation; rape; as, abuse of a female child.'),
(418, 'Abuseful', 'a.', 'Full of abuse; abusive.'),
(419, 'Abuser', 'n.', 'One who abuses [in the various senses of the verb].'),
(420, 'Abusion', 'v. t.', 'Evil or corrupt usage; abuse; wrong; reproach;\n   deception; cheat.'),
(421, 'Abusive', 'a.', 'Wrongly used; perverted; misapplied.'),
(422, 'Abusive', 'a.', 'Given to misusing; also, full of abuses.'),
(423, 'Abusive', 'a.', 'Practicing abuse; prone to ill treat by coarse, insulting\n   words or by other ill usage; as, an abusive author; an abusive fellow.'),
(424, 'Abusive', 'a.', 'Containing abuse, or serving as the instrument of abuse;\n   vituperative; reproachful; scurrilous.'),
(425, 'Abusive', 'a.', 'Tending to deceive; fraudulent; cheating.'),
(426, 'Abutted', 'imp. & p. p.', 'of Abut'),
(427, 'Abutting', 'p. pr. & vb. n.', 'of Abut'),
(428, 'Abutilon', 'n.', 'A genus of malvaceous plants of many species, found in\n   the torrid and temperate zones of both continents; -- called also\n   Indian mallow.'),
(429, 'Abutment', 'n.', 'State of abutting.'),
(430, 'Abutment', 'n.', 'That on or against which a body abuts or presses'),
(431, 'Abutment', 'n.', 'The solid part of a pier or wall, etc., which receives\n   the thrust or lateral pressure of an arch, vault, or strut.'),
(432, 'Abutment', 'n.', 'A fixed point or surface from which resistance or\n   reaction is obtained, as the cylinder head of a steam engine, the\n   fulcrum of a lever, etc.'),
(433, 'Abutment', 'n.', 'In breech-loading firearms, the block behind the barrel\n   which receives the pressure due to recoil.'),
(434, 'Abuttal', 'n.', 'The butting or boundary of land, particularly at the end;\n   a headland.'),
(435, 'Abutter', 'n.', 'One who, or that which, abuts. Specifically, the owner of\n   a contiguous estate; as, the abutters on a street or a river.'),
(436, 'Abuzz', 'a.', 'In a buzz; buzzing.'),
(437, 'Abought', 'imp. & p. p.', 'of Abye'),
(438, 'Abysm', 'n.', 'An abyss; a gulf.'),
(439, 'Abysmal', 'a.', 'Pertaining to, or resembling, an abyss; bottomless;\n   unending; profound.'),
(440, 'Abyss', 'n.', 'A bottomless or unfathomed depth, gulf, or chasm; hence, any\n   deep, immeasurable, and, specifically, hell, or the bottomless pit.'),
(441, 'Abyss', 'n.', 'Infinite time; a vast intellectual or moral depth.'),
(442, 'Abyss', 'n.', 'The center of an escutcheon.'),
(443, 'Abyssal', 'a.', 'Belonging to, or resembling, an abyss; unfathomable.'),
(444, 'Acacia', 'n.', 'A roll or bag, filled with dust, borne by Byzantine\n   emperors, as a memento of mortality. It is represented on medals.'),
(445, 'Acacias', 'pl. ', 'of Acacia'),
(446, 'Acaciae', 'pl. ', 'of Acacia'),
(447, 'Acacia', 'n.', 'A genus of leguminous trees and shrubs. Nearly 300 species\n   are Australian or Polynesian, and have terete or vertically compressed\n   leaf stalks, instead of the bipinnate leaves of the much fewer species\n   of America, Africa, etc. Very few are found in temperate climates.'),
(448, 'Acacia', 'n.', 'The inspissated juice of several species of acacia; --\n   called also gum acacia, and gum arabic.'),
(449, 'Acacin', 'n.', 'Alt. of Acacine'),
(450, 'Acacine', 'n.', 'Gum arabic.'),
(451, 'Academe', 'n.', 'An academy.'),
(452, 'Academic', 'a.', 'Alt. of Academical'),
(453, 'Academic', 'n.', 'One holding the philosophy of Socrates and Plato; a\n   Platonist.'),
(454, 'Academic', 'n.', 'A member of an academy, college, or university; an\n   academician.'),
(455, 'Academy', 'n.', 'A garden or grove near Athens (so named from the hero\n   Academus), where Plato and his followers held their philosophical\n   conferences; hence, the school of philosophy of which Plato was head.'),
(456, 'Academy', 'n.', 'An institution for the study of higher learning; a college\n   or a university. Popularly, a school, or seminary of learning, holding\n   a rank between a college and a common school.'),
(457, 'Academy', 'n.', 'A place of training; a school.'),
(458, 'Academy', 'n.', 'A society of learned men united for the advancement of the\n   arts and sciences, and literature, or some particular art or science;\n   as, the French Academy; the American Academy of Arts and Sciences;\n   academies of literature and philology.'),
(459, 'Academy', 'n.', 'A school or place of training in which some special art is\n   taught; as, the military academy at West Point; a riding academy; the\n   Academy of Music.'),
(460, 'Acadian', 'a.', 'Of or pertaining to Acadie, or Nova Scotia.'),
(461, 'Acadian', 'n.', 'A native of Acadie.'),
(462, 'Acajou', 'n.', 'The cashew tree; also, its fruit. See Cashew.'),
(463, 'Acajou', 'n.', 'The mahogany tree; also, its timber.'),
(464, 'Acalephs', 'pl. ', 'of Acalephan'),
(465, 'Acaleph', 'n.', 'Alt. of Acalephan'),
(466, 'Acanth', 'n.', 'Same as Acanthus.'),
(467, 'Acantha', 'n.', 'A prickle.'),
(468, 'Acantha', 'n.', 'A spine or prickly fin.'),
(469, 'Acantha', 'n.', 'The vertebral column; the spinous process of a vertebra.'),
(470, 'Acanthi', 'pl. ', 'of Acanthus'),
(471, 'Acanthus', 'n.', 'A genus of herbaceous prickly plants, found in the south\n   of Europe, Asia Minor, and India; bear\'s-breech.'),
(472, 'Acanthus', 'n.', 'An ornament resembling the foliage or leaves of the\n   acanthus (Acanthus spinosus); -- used in the capitals of the Corinthian\n   and Composite orders.'),
(473, 'Acardiac', 'a.', 'Without a heart; as, an acardiac fetus.'),
(474, 'Acaridan', 'n.', 'One of a group of arachnids, including the mites and\n   ticks.'),
(475, 'Acarina', 'n. pl.', 'The group of Arachnida which includes the mites and\n   ticks. Many species are parasitic, and cause diseases like the itch and\n   mange.'),
(476, 'Acarine', 'a.', 'Of or caused by acari or mites; as, acarine diseases.'),
(477, 'Acaroid', 'a.', 'Shaped like or resembling a mite.'),
(478, 'Acarpous', 'a.', 'Not producing fruit; unfruitful.'),
(479, 'Acari', 'pl. ', 'of Acarus'),
(480, 'Acarus', 'n.', 'A genus including many species of small mites.'),
(481, 'Acater', 'n.', 'See Caterer.'),
(482, 'Acates', 'n. pl.', 'See Cates.'),
(483, 'Acaudate', 'a.', 'Tailless.'),
(484, 'Acauline', 'a.', 'Same as Acaulescent.'),
(485, 'Acaulose', 'a.', 'Alt. of Acaulous'),
(486, 'Acaulous', 'a.', 'Same as Acaulescent.'),
(487, 'Accadian', 'a.', 'Pertaining to a race supposed to have lived in Babylonia\n   before the Assyrian conquest.'),
(488, 'Acceded', 'imp. & p. p.', 'of Accede'),
(489, 'Acceding', 'p. pr. & vb. n.', 'of Accede'),
(490, 'Accede', 'v. i.', 'To approach; to come forward; -- opposed to recede.'),
(491, 'Accede', 'v. i.', 'To enter upon an office or dignity; to attain.'),
(492, 'Accede', 'v. i.', 'To become a party by associating one\'s self with others;\n   to give one\'s adhesion. Hence, to agree or assent to a proposal or a\n   view; as, he acceded to my request.'),
(493, 'Acceder', 'n.', 'One who accedes.'),
(494, 'Accend', 'v. t.', 'To set on fire; to kindle.'),
(495, 'Accensor', 'n.', 'One of the functionaries who light and trim the tapers.'),
(496, 'Accent', 'n.', 'A superior force of voice or of articulative effort upon\n   some particular syllable of a word or a phrase, distinguishing it from\n   the others.'),
(497, 'Accent', 'n.', 'A mark or character used in writing, and serving to\n   regulate the pronunciation; esp.: (a) a mark to indicate the nature and\n   place of the spoken accent; (b) a mark to indicate the quality of sound\n   of the vowel marked; as, the French accents.'),
(498, 'Accent', 'n.', 'Modulation of the voice in speaking; manner of speaking or\n   pronouncing; peculiar or characteristic modification of the voice;\n   tone; as, a foreign accent; a French or a German accent.'),
(499, 'Accent', 'n.', 'A word; a significant tone'),
(500, 'Accent', 'n.', 'expressions in general; speech.'),
(501, 'Accent', 'n.', 'Stress laid on certain syllables of a verse.'),
(502, 'Accent', 'n.', 'A regularly recurring stress upon the tone to mark the\n   beginning, and, more feebly, the third part of the measure.'),
(503, 'Accent', 'n.', 'A special emphasis of a tone, even in the weaker part of\n   the measure.'),
(504, 'Accent', 'n.', 'The rhythmical accent, which marks phrases and sections of\n   a period.'),
(505, 'Accent', 'n.', 'The expressive emphasis and shading of a passage.'),
(506, 'Accent', 'n.', 'A mark placed at the right hand of a letter, and a little\n   above it, to distinguish magnitudes of a similar kind expressed by the\n   same letter, but differing in value, as y\', y\'\'.'),
(507, 'Accent', 'n.', 'A mark at the right hand of a number, indicating minutes of\n   a degree, seconds, etc.; as, 12\'27\'\', i. e., twelve minutes twenty\n   seven seconds.'),
(508, 'Accent', 'n.', 'A mark used to denote feet and inches; as, 6\' 10\'\' is six\n   feet ten inches.'),
(509, 'Accented', 'imp. & p. p.', 'of Accent'),
(510, 'Accent', 'v. t.', 'To express the accent of (either by the voice or by a\n   mark); to utter or to mark with accent.'),
(511, 'Accent', 'v. t.', 'To mark emphatically; to emphasize.'),
(512, 'Accentor', 'n.', 'One who sings the leading part; the director or leader.'),
(513, 'Accentor', 'n.', 'A genus of European birds (so named from their sweet\n   notes), including the hedge warbler. In America sometimes applied to\n   the water thrushes.'),
(514, 'Accepted', 'imp. & p. p.', 'of Accept'),
(515, 'Accept', 'v. t.', 'To receive with a consenting mind (something offered);\n   as, to accept a gift; -- often followed by of.'),
(516, 'Accept', 'v. t.', 'To receive with favor; to approve.'),
(517, 'Accept', 'v. t.', 'To receive or admit and agree to; to assent to; as, I\n   accept your proposal, amendment, or excuse.'),
(518, 'Accept', 'v. t.', 'To take by the mind; to understand; as, How are these\n   words to be accepted?'),
(519, 'Accept', 'v. t.', 'To receive as obligatory and promise to pay; as, to\n   accept a bill of exchange.'),
(520, 'Accept', 'v. t.', 'In a deliberate body, to receive in acquittance of a\n   duty imposed; as, to accept the report of a committee. [This makes it\n   the property of the body, and the question is then on its adoption.]'),
(521, 'Accept', 'a.', 'Accepted.'),
(522, 'Accepter', 'n.', 'A person who accepts; a taker.'),
(523, 'Accepter', 'n.', 'A respecter; a viewer with partiality.'),
(524, 'Accepter', 'n.', 'An acceptor.'),
(525, 'Acceptor', 'n.', 'One who accepts'),
(526, 'Acceptor', 'n.', 'one who accepts an order or a bill of exchange; a drawee\n   after he has accepted.'),
(527, 'Access', 'n.', 'A coming to, or near approach; admittance; admission;\n   accessibility; as, to gain access to a prince.'),
(528, 'Access', 'n.', 'The means, place, or way by which a thing may be\n   approached; passage way; as, the access is by a neck of land.'),
(529, 'Access', 'n.', 'Admission to sexual intercourse.'),
(530, 'Access', 'n.', 'Increase by something added; addition; as, an access of\n   territory. [In this sense accession is more generally used.]'),
(531, 'Access', 'n.', 'An onset, attack, or fit of disease.'),
(532, 'Access', 'n.', 'A paroxysm; a fit of passion; an outburst; as, an access of\n   fury.'),
(533, 'Accident', 'n.', 'Literally, a befalling; an event that takes place without\n   one\'s foresight or expectation; an undesigned, sudden, and unexpected\n   event; chance; contingency; often, an undesigned and unforeseen\n   occurrence of an afflictive or unfortunate character; a casualty; a\n   mishap; as, to die by an accident.'),
(534, 'Accident', 'n.', 'A property attached to a word, but not essential to it,\n   as gender, number, case.'),
(535, 'Accident', 'n.', 'A point or mark which may be retained or omitted in a\n   coat of arms.'),
(536, 'Accident', 'n.', 'A property or quality of a thing which is not essential\n   to it, as whiteness in paper; an attribute.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(537, 'Accident', 'n.', 'A quality or attribute in distinction from the substance,\n   as sweetness, softness.'),
(538, 'Accident', 'n.', 'Any accidental property, fact, or relation; an accidental\n   or nonessential; as, beauty is an accident.'),
(539, 'Accident', 'n.', 'Unusual appearance or effect.'),
(540, 'Accidie', 'n.', 'Sloth; torpor.'),
(541, 'Accismus', 'n.', 'Affected refusal; coyness.'),
(542, 'Accite', 'v. t.', 'To cite; to summon.'),
(543, 'Acclaim', 'v. t.', 'To applaud.'),
(544, 'Acclaim', 'v. t.', 'To declare by acclamations.'),
(545, 'Acclaim', 'v. t.', 'To shout; as, to acclaim my joy.'),
(546, 'Acclaim', 'v. i.', 'To shout applause.'),
(547, 'Acclaim', 'n.', 'Acclamation.'),
(548, 'Acclive', 'a.', 'Acclivous.'),
(549, 'Accloy', 'v. t.', 'To fill to satiety; to stuff full; to clog; to overload;\n   to burden. See Cloy.'),
(550, 'Accoast', 'v. t. & i.', 'To lie or sail along the coast or side of; to\n   accost.'),
(551, 'Accoil', 'v. t.', 'To gather together; to collect.'),
(552, 'Accoil', 'v. t.', 'To coil together.'),
(553, 'Accolade', 'n.', 'A ceremony formerly used in conferring knighthood,\n   consisting am embrace, and a slight blow on the shoulders with the flat\n   blade of a sword.'),
(554, 'Accolade', 'n.', 'A brace used to join two or more staves.'),
(555, 'Accompt', 'n.', 'See Account.'),
(556, 'Accord', 'v. t.', 'Agreement or concurrence of opinion, will, or action;\n   harmony of mind; consent; assent.'),
(557, 'Accord', 'v. t.', 'Harmony of sounds; agreement in pitch and tone; concord;\n   as, the accord of tones.'),
(558, 'Accord', 'v. t.', 'Agreement, harmony, or just correspondence of things;\n   as, the accord of light and shade in painting.'),
(559, 'Accord', 'v. t.', 'Voluntary or spontaneous motion or impulse to act; --\n   preceded by own; as, of one\'s own accord.'),
(560, 'Accord', 'v. t.', 'An agreement between parties in controversy, by which\n   satisfaction for an injury is stipulated, and which, when executed,\n   bars a suit.'),
(561, 'Accorded', 'imp. & p. p.', 'of Accord'),
(562, 'Accord', 'v. t.', 'To make to agree or correspond; to suit one thing to\n   another; to adjust; -- followed by to.'),
(563, 'Accord', 'v. t.', 'To bring to an agreement, as persons; to reconcile; to\n   settle, adjust, harmonize, or compose, as things; as, to accord suits\n   or controversies.'),
(564, 'Accord', 'v. t.', 'To grant as suitable or proper; to concede; to award;\n   as, to accord to one due praise.'),
(565, 'Accord', 'v. i.', 'To agree; to correspond; to be in harmony; -- followed\n   by with, formerly also by to; as, his disposition accords with his\n   looks.'),
(566, 'Accord', 'v. i.', 'To agree in pitch and tone.'),
(567, 'Accorder', 'n.', 'One who accords, assents, or concedes.'),
(568, 'Accosted', 'imp. & p. p.', 'of Accost'),
(569, 'Accost', 'v. t.', 'To join side to side; to border; hence, to sail along\n   the coast or side of.'),
(570, 'Accost', 'v. t.', 'To approach; to make up to.'),
(571, 'Accost', 'v. t.', 'To speak to first; to address; to greet.'),
(572, 'Accost', 'v. i.', 'To adjoin; to lie alongside.'),
(573, 'Accost', 'n.', 'Address; greeting.'),
(574, 'Accosted', 'a.', 'Supported on both sides by other charges; also, side by\n   side.'),
(575, 'Account', 'n.', 'A reckoning; computation; calculation; enumeration; a\n   record of some reckoning; as, the Julian account of time.'),
(576, 'Account', 'n.', 'A registry of pecuniary transactions; a written or printed\n   statement of business dealings or debts and credits, and also of other\n   things subjected to a reckoning or review; as, to keep one\'s account at\n   the bank.'),
(577, 'Account', 'n.', 'A statement in general of reasons, causes, grounds, etc.,\n   explanatory of some event; as, no satisfactory account has been given\n   of these phenomena. Hence, the word is often used simply for reason,\n   ground, consideration, motive, etc.; as, on no account, on every\n   account, on all accounts.'),
(578, 'Account', 'n.', 'A statement of facts or occurrences; recital of\n   transactions; a relation or narrative; a report; a description; as, an\n   account of a battle.'),
(579, 'Account', 'n.', 'A statement and explanation or vindication of one\'s\n   conduct with reference to judgment thereon.'),
(580, 'Account', 'n.', 'An estimate or estimation; valuation; judgment.'),
(581, 'Account', 'n.', 'Importance; worth; value; advantage; profit.'),
(582, 'Account', 'v. t.', 'To reckon; to compute; to count.'),
(583, 'Account', 'v. t.', 'To place to one\'s account; to put to the credit of; to\n   assign; -- with to.'),
(584, 'Account', 'v. t.', 'To value, estimate, or hold in opinion; to judge or\n   consider; to deem.'),
(585, 'Account', 'v. t.', 'To recount; to relate.'),
(586, 'Account', 'v. i.', 'To render or receive an account or relation of\n   particulars; as, an officer must account with or to the treasurer for\n   money received.'),
(587, 'Account', 'v. i.', 'To render an account; to answer in judgment; -- with\n   for; as, we must account for the use of our opportunities.'),
(588, 'Account', 'v. i.', 'To give a satisfactory reason; to tell the cause of; to\n   explain; -- with for; as, idleness accounts for poverty.'),
(589, 'Accouple', 'v. t.', 'To join; to couple.'),
(590, 'Accourt', 'v. t.', 'To treat courteously; to court.'),
(591, 'Accouter', 'v. t.', 'Alt. of Accoutre'),
(592, 'Accoutre', 'v. t.', 'To furnish with dress, or equipments, esp. those for\n   military service; to equip; to attire; to array.'),
(593, 'Accoy', 'v. t.', 'To render quiet; to soothe.'),
(594, 'Accoy', 'v. t.', 'To subdue; to tame; to daunt.'),
(595, 'Accredit', 'v. t.', 'To put or bring into credit; to invest with credit or\n   authority; to sanction.'),
(596, 'Accredit', 'v. t.', 'To send with letters credential, as an ambassador,\n   envoy, or diplomatic agent; to authorize, as a messenger or delegate.'),
(597, 'Accredit', 'v. t.', 'To believe; to credit; to put trust in.'),
(598, 'Accredit', 'v. t.', 'To credit; to vouch for or consider (some one) as\n   doing something, or (something) as belonging to some one.'),
(599, 'Accresce', 'v. i.', 'To accrue.'),
(600, 'Accresce', 'v. i.', 'To increase; to grow.'),
(601, 'Accrete', 'v. i.', 'To grow together.'),
(602, 'Accrete', 'v. i.', 'To adhere; to grow (to); to be added; -- with to.'),
(603, 'Accrete', 'v. t.', 'To make adhere; to add.'),
(604, 'Accrete', 'a.', 'Characterized by accretion; made up; as, accrete matter.'),
(605, 'Accrete', 'a.', 'Grown together.'),
(606, 'Accroach', 'v. t.', 'To hook, or draw to one\'s self as with a hook.'),
(607, 'Accroach', 'v. t.', 'To usurp, as jurisdiction or royal prerogatives.'),
(608, 'Accrual', 'n.', 'Accrument.'),
(609, 'Accrued', 'imp. & p. p.', 'of Accrue'),
(610, 'Accruing', 'p. pr. & vb. n.', 'of Accrue'),
(611, 'Accrue', 'n.', 'To increase; to augment.'),
(612, 'Accrue', 'n.', 'To come to by way of increase; to arise or spring as a\n   growth or result; to be added as increase, profit, or damage,\n   especially as the produce of money lent.'),
(613, 'Accrue', 'n.', 'Something that accrues; advantage accruing.'),
(614, 'Accruer', 'n.', 'The act of accruing; accretion; as, title by accruer.'),
(615, 'Accumb', 'v. i.', 'To recline, as at table.'),
(616, 'Accumber', 'v. t.', 'To encumber.'),
(617, 'Accuracy', 'n.', 'The state of being accurate; freedom from mistakes, this\n   exemption arising from carefulness; exact conformity to truth, or to a\n   rule or model; precision; exactness; nicety; correctness; as, the value\n   of testimony depends on its accuracy.'),
(618, 'Accurate', 'a.', 'In exact or careful conformity to truth, or to some\n   standard of requirement, the result of care or pains; free from\n   failure, error, or defect; exact; as, an accurate calculator; an\n   accurate measure; accurate expression, knowledge, etc.'),
(619, 'Accurate', 'a.', 'Precisely fixed; executed with care; careful.'),
(620, 'Accurse', 'v. t.', 'To devote to destruction; to imprecate misery or evil\n   upon; to curse; to execrate; to anathematize.'),
(621, 'Accursed', 'p. p. & a.', 'Alt. of Accurst'),
(622, 'Accurst', 'p. p. & a.', 'Doomed to destruction or misery; cursed; hence,\n   bad enough to be under the curse; execrable; detestable; exceedingly\n   hateful; -- as, an accursed deed.'),
(623, 'Accusal', 'n.', 'Accusation.'),
(624, 'Accusant', 'n.', 'An accuser.'),
(625, 'Accuse', 'n.', 'Accusation.'),
(626, 'Accused', 'imp. & p. p.', 'of Accuse'),
(627, 'Accusing', 'p. pr. & vb. n.', 'of Accuse'),
(628, 'Accuse', 'v. t.', 'To charge with, or declare to have committed, a crime or\n   offense'),
(629, 'Accuse', 'v. t.', 'to charge with an offense, judicially or by a public\n   process; -- with of; as, to accuse one of a high crime or misdemeanor.'),
(630, 'Accuse', 'v. t.', 'To charge with a fault; to blame; to censure.'),
(631, 'Accuse', 'v. t.', 'To betray; to show. [L.]'),
(632, 'Accused', 'a.', 'Charged with offense; as, an accused person.'),
(633, 'Accuser', 'n.', 'One who accuses; one who brings a charge of crime or\n   fault.'),
(634, 'Accustom', 'v. t.', 'To make familiar by use; to habituate, familiarize, or\n   inure; -- with to.'),
(635, 'Accustom', 'v. i.', 'To be wont.'),
(636, 'Accustom', 'v. i.', 'To cohabit.'),
(637, 'Accustom', 'n.', 'Custom.'),
(638, 'Aceldama', 'n.', 'The potter\'s field, said to have lain south of Jerusalem,\n   purchased with the bribe which Judas took for betraying his Master, and\n   therefore called the field of blood. Fig.: A field of bloodshed.'),
(639, 'Acentric', 'a.', 'Not centered; without a center.'),
(640, 'Acephal', 'n.', 'One of the Acephala.'),
(641, 'Acephala', 'n. pl.', 'That division of the Mollusca which includes the\n   bivalve shells, like the clams and oysters; -- so called because they\n   have no evident head. Formerly the group included the Tunicata,\n   Brachiopoda, and sometimes the Bryozoa. See Mollusca.'),
(642, 'Acephali', 'n. pl.', 'A fabulous people reported by ancient writers to have\n   heads.'),
(643, 'Acephali', 'n. pl.', 'A Christian sect without a leader.'),
(644, 'Acephali', 'n. pl.', 'Bishops and certain clergymen not under regular\n   diocesan control.'),
(645, 'Acephali', 'n. pl.', 'A class of levelers in the time of K. Henry I.'),
(646, 'Acerate', 'n.', 'A combination of aceric acid with a salifiable base.'),
(647, 'Acerate', 'a.', 'Acerose; needle-shaped.'),
(648, 'Acerb', 'a.', 'Sour, bitter, and harsh to the taste, as unripe fruit; sharp\n   and harsh.'),
(649, 'Acerbate', 'v. t.', 'To sour; to imbitter; to irritate.'),
(650, 'Acerbic', 'a.', 'Sour or severe.'),
(651, 'Acerbity', 'n.', 'Sourness of taste, with bitterness and astringency, like\n   that of unripe fruit.'),
(652, 'Acerbity', 'n.', 'Harshness, bitterness, or severity; as, acerbity of\n   temper, of language, of pain.'),
(653, 'Aceric', 'a.', 'Pertaining to, or obtained from, the maple; as, aceric\n   acid.'),
(654, 'Acerose', 'a.', 'Having the nature of chaff; chaffy.'),
(655, 'Acerose', 'a.', 'Needle-shaped, having a sharp, rigid point, as the leaf of\n   the pine.'),
(656, 'Acerous', 'a.', 'Same as Acerose.'),
(657, 'Acerous', 'a.', 'Destitute of tentacles, as certain mollusks.'),
(658, 'Acerous', 'a.', 'Without antennae, as some insects.'),
(659, 'Acerval', 'a.', 'Pertaining to a heap.'),
(660, 'Acervate', 'v. t.', 'To heap up.'),
(661, 'Acervate', 'a.', 'Heaped, or growing in heaps, or closely compacted\n   clusters.'),
(662, 'Acervose', 'a.', 'Full of heaps.'),
(663, 'Acescent', 'a.', 'Turning sour; readily becoming tart or acid; slightly\n   sour.'),
(664, 'Acescent', 'n.', 'A substance liable to become sour.'),
(665, 'Acetable', 'n.', 'An acetabulum; or about one eighth of a pint.'),
(666, 'Acetal', 'n.', 'A limpid, colorless, inflammable liquid from the slow\n   oxidation of alcohol under the influence of platinum black.'),
(667, 'Acetary', 'n.', 'An acid pulp in certain fruits, as the pear.'),
(668, 'Acetate', 'n.', 'A salt formed by the union of acetic acid with a base or\n   positive radical; as, acetate of lead, acetate of potash.'),
(669, 'Acetated', 'a.', 'Combined with acetic acid.'),
(670, 'Acetic', 'a.', 'Of a pertaining to vinegar; producing vinegar; producing\n   vinegar; as, acetic fermentation.'),
(671, 'Acetic', 'a.', 'Pertaining to, containing, or derived from, acetyl, as\n   acetic ether, acetic acid. The latter is the acid to which the sour\n   taste of vinegar is due.'),
(672, 'Acetify', 'v. t.', 'To convert into acid or vinegar.'),
(673, 'Acetify', 'v. i.', 'To turn acid.'),
(674, 'Acetin', 'n.', 'A combination of acetic acid with glycerin.'),
(675, 'Acetize', 'v. i.', 'To acetify.'),
(676, 'Acetone', 'n.', 'A volatile liquid consisting of three parts of carbon, six\n   of hydrogen, and one of oxygen; pyroacetic spirit, -- obtained by the\n   distillation of certain acetates, or by the destructive distillation of\n   citric acid, starch, sugar, or gum, with quicklime.'),
(677, 'Acetonic', 'a.', 'Of or pertaining to acetone; as, acetonic bodies.'),
(678, 'Acetose', 'a.', 'Sour like vinegar; acetous.'),
(679, 'Acetous', 'a.', 'Having a sour taste; sour; acid.'),
(680, 'Acetous', 'a.', 'Causing, or connected with, acetification; as, acetous\n   fermentation.'),
(681, 'Acetyl', 'n.', 'A complex, hypothetical radical, composed of two parts of\n   carbon to three of hydrogen and one of oxygen. Its hydroxide is acetic\n   acid.'),
(682, 'Achaean', 'a.', 'Alt. of Achaian'),
(683, 'Achaian', 'a.', 'Of or pertaining to Achaia in Greece; also, Grecian.'),
(684, 'Achaian', 'n.', 'A native of Achaia; a Greek.'),
(685, 'Achate', 'n.', 'An agate.'),
(686, 'Achate', 'n.', 'Purchase; bargaining.'),
(687, 'Achate', 'n.', 'Provisions. Same as Cates.'),
(688, 'Achatina', 'n.', 'A genus of land snails, often large, common in the warm\n   parts of America and Africa.'),
(689, 'Achatour', 'n.', 'Purveyor; acater.'),
(690, 'Ached', 'imp. & p. p.', 'of Ache'),
(691, 'Aching', 'p. pr. & vb. n.', 'of Ache'),
(692, 'Achean', 'a & n.', 'See Achaean, Achaian.'),
(693, 'Achene', 'n.', 'Alt. of Achenium'),
(694, 'Achenium', 'n.', 'A small, dry, indehiscent fruit, containing a single\n   seed, as in the buttercup; -- called a naked seed by the earlier\n   botanists.'),
(695, 'Achenial', 'a.', 'Pertaining to an achene.'),
(696, 'Acheron', 'n.', 'A river in the Nether World or infernal regions; also, the\n   infernal regions themselves. By some of the English poets it was\n   supposed to be a flaming lake or gulf.'),
(697, 'Achieved', 'imp. & p. p.', 'of Achieve'),
(698, 'Achieve', 'v. t.', 'To carry on to a final close; to bring out into a\n   perfected state; to accomplish; to perform; -- as, to achieve a feat,\n   an exploit, an enterprise.'),
(699, 'Achieve', 'v. t.', 'To obtain, or gain, as the result of exertion; to\n   succeed in gaining; to win.'),
(700, 'Achieve', 'v. t.', 'To finish; to kill.'),
(701, 'Achiever', 'n.', 'One who achieves; a winner.'),
(702, 'Achilous', 'a.', 'Without a lip.'),
(703, 'Aching', 'a.', 'That aches; continuously painful. See Ache.'),
(704, 'Achiote', 'n.', 'Seeds of the annotto tree; also, the coloring matter,\n   annotto.'),
(705, 'Acholia', 'n.', 'Deficiency or want of bile.'),
(706, 'Acholous', 'a.', 'Lacking bile.'),
(707, 'Achronic', 'a.', 'See Acronyc.'),
(708, 'Achroous', 'a.', 'Colorless; achromatic.'),
(709, 'Achylous', 'a.', 'Without chyle.'),
(710, 'Achymous', 'a.', 'Without chyme.'),
(711, 'Aciculae', 'pl. ', 'of Acicula'),
(712, 'Acicula', 'n.', 'One of the needlelike or bristlelike spines or prickles of\n   some animals and plants; also, a needlelike crystal.'),
(713, 'Acicular', 'a.', 'Needle-shaped; slender like a needle or bristle, as some\n   leaves or crystals; also, having sharp points like needless.'),
(714, 'Acidic', 'a.', 'Containing a high percentage of silica; -- opposed to\n   basic.'),
(715, 'Acidific', 'a.', 'Producing acidity; converting into an acid.'),
(716, 'Acidify', 'v. t.', 'To make acid; to convert into an acid; as, to acidify\n   sugar.'),
(717, 'Acidify', 'v. t.', 'To sour; to imbitter.'),
(718, 'Acidity', 'n.', 'The quality of being sour; sourness; tartness; sharpness\n   to the taste; as, the acidity of lemon juice.'),
(719, 'Acidly', 'adv.', 'Sourly; tartly.'),
(720, 'Acidness', 'n.', 'Acidity; sourness.'),
(721, 'Acierage', 'n.', 'The process of coating the surface of a metal plate (as a\n   stereotype plate) with steellike iron by means of voltaic electricity;\n   steeling.'),
(722, 'Aciform', 'a.', 'Shaped like a needle.'),
(723, 'Acinaces', 'n.', 'A short sword or saber.'),
(724, 'Acinesia', 'n.', 'Same as Akinesia.'),
(725, 'Acinetae', 'n. pl.', 'A group of suctorial Infusoria, which in the adult\n   stage are stationary. See Suctoria.'),
(726, 'Acinose', 'a.', 'Alt. of Acinous'),
(727, 'Acinous', 'a.', 'Consisting of acini, or minute granular concretions; as,\n   acinose or acinous glands.'),
(728, 'Acini', 'pl. ', 'of Acinus'),
(729, 'Acinus', 'n.', 'One of the small grains or drupelets which make up some\n   kinds of fruit, as the blackberry, raspberry, etc.'),
(730, 'Acinus', 'n.', 'A grapestone.'),
(731, 'Acinus', 'n.', 'One of the granular masses which constitute a racemose or\n   compound gland, as the pancreas; also, one of the saccular recesses in\n   the lobules of a racemose gland.'),
(732, 'Aciurgy', 'n.', 'Operative surgery.'),
(733, 'Acknow', 'v. t.', 'To recognize.'),
(734, 'Acknow', 'v. t.', 'To acknowledge; to confess.'),
(735, 'Aclinic', 'a.', 'Without inclination or dipping; -- said the magnetic\n   needle balances itself horizontally, having no dip. The aclinic line is\n   also termed the magnetic equator.'),
(736, 'Acnodal', 'a.', 'Pertaining to acnodes.'),
(737, 'Acnode', 'n.', 'An isolated point not upon a curve, but whose coordinates\n   satisfy the equation of the curve so that it is considered as belonging\n   to the curve.'),
(738, 'Acock', 'adv.', 'In a cocked or turned up fashion.'),
(739, 'Acold', 'a.', 'Cold.'),
(740, 'Acologic', 'a.', 'Pertaining to acology.'),
(741, 'Acology', 'n.', 'Materia medica; the science of remedies.'),
(742, 'Acolyte', 'n.', 'One who has received the highest of the four minor orders\n   in the Catholic church, being ordained to carry the wine and water and\n   the lights at the Mass.'),
(743, 'Acolyte', 'n.', 'One who attends; an assistant.'),
(744, 'Acolyth', 'n.', 'Same as Acolyte.'),
(745, 'Aconital', 'a.', 'Of the nature of aconite.'),
