(988, 'Address', 'v.', 'To make suit to as a lover; to court; to woo.'),
(989, 'Address', 'v.', 'To consign or intrust to the care of another, as agent or\n   factor; as, the ship was addressed to a merchant in Baltimore.'),
(990, 'Address', 'v. i.', 'To prepare one\'s self.'),
(991, 'Address', 'v. i.', 'To direct speech.'),
(992, 'Address', 'v. t.', 'Act of preparing one\'s self.'),
(993, 'Address', 'v. t.', 'Act of addressing one\'s self to a person; verbal\n   application.'),
(994, 'Address', 'v. t.', 'A formal communication, either written or spoken; a\n   discourse; a speech; a formal application to any one; a petition; a\n   formal statement on some subject or special occasion; as, an address of\n   thanks, an address to the voters.'),
(995, 'Address', 'v. t.', 'Direction or superscription of a letter, or the name,\n   title, and place of residence of the person addressed.'),
(996, 'Address', 'v. t.', 'Manner of speaking to another; delivery; as, a man of\n   pleasing or insinuating address.'),
(997, 'Address', 'v. t.', 'Attention in the way one\'s addresses to a lady.'),
(998, 'Address', 'v. t.', 'Skill; skillful management; dexterity; adroitness.'),
(999, 'Adduced', 'imp. & p. p.', 'of Adduce'),
(1000, 'Adducing', 'p. pr. & vb. n.', 'of Adduce'),
(1001, 'Adduce', 'v. t.', 'To bring forward or offer, as an argument, passage, or\n   consideration which bears on a statement or case; to cite; to allege.'),
(1002, 'Adducent', 'a.', 'Bringing together or towards a given point; -- a word\n   applied to those muscles of the body which pull one part towards\n   another. Opposed to abducent.'),
(1003, 'Adducer', 'n.', 'One who adduces.'),
(1004, 'Adduct', 'v. t.', 'To draw towards a common center or a middle line.'),
(1005, 'Adductor', 'n.', 'A muscle which draws a limb or part of the body toward\n   the middle line of the body, or closes extended parts of the body; --\n   opposed to abductor; as, the adductor of the eye, which turns the eye\n   toward the nose.'),
(1006, 'Addulce', 'v. t.', 'To sweeten; to soothe.'),
(1007, 'Adeem', 'v. t.', 'To revoke, as a legacy, grant, etc., or to satisfy it by\n   some other gift.'),
(1008, 'Adeling', 'n.', 'Same as Atheling.'),
(1009, 'Adelopod', 'n.', 'An animal having feet that are not apparent.'),
(1010, 'Adelphia', 'n.', 'A \"brotherhood,\" or collection of stamens in a bundle; --\n   used in composition, as in the class names, Monadelphia, Diadelphia,\n   etc.'),
(1011, 'Adempt', 'p. p.', 'Takes away.'),
(1012, 'Aden-', '', 'Alt. of Adeno-'),
(1013, 'Adeno-', '', 'Combining forms of the Greek word for gland; -- used in words\n   relating to the structure, diseases, etc., of the glands.'),
(1014, 'Adenalgy', 'n.', 'Pain in a gland.'),
(1015, 'Adenitis', 'n.', 'Glandular inflammation.'),
(1016, 'Adenoid', 'a.', 'Alt. of Adenoidal'),
(1017, 'Adenose', 'a.', 'Like a gland; full of glands; glandulous; adenous.'),
(1018, 'Adenous', 'a.', 'Same as Adenose.'),
(1019, 'Adeps', 'n.', 'Animal fat; lard.'),
(1020, 'Adept', 'n.', 'One fully skilled or well versed in anything; a proficient;\n   as, adepts in philosophy.'),
(1021, 'Adept', 'a.', 'Well skilled; completely versed; thoroughly proficient.'),
(1022, 'Adeption', 'a.', 'An obtaining; attainment.'),
(1023, 'Adeptist', 'n.', 'A skilled alchemist.'),
(1024, 'Adequacy', 'n.', 'The state or quality of being adequate, proportionate, or\n   sufficient; a sufficiency for a particular purpose; as, the adequacy of\n   supply to the expenditure.'),
(1025, 'Adequate', 'a.', 'Equal to some requirement; proportionate, or\n   correspondent; fully sufficient; as, powers adequate to a great work;\n   an adequate definition.'),
(1026, 'Adequate', 'a.', 'To equalize; to make adequate.'),
(1027, 'Adequate', 'a.', 'To equal.'),
(1028, 'Adesmy', 'n.', 'The division or defective coherence of an organ that is\n   usually entire.'),
(1029, 'Adfected', 'v.', 'See Affected, 5.'),
(1030, 'Adhamant', 'a.', 'Clinging, as by hooks.'),
(1031, 'Adhered', 'imp. & p. p.', 'of Adhere'),
(1032, 'Adhering', 'p. pr. & vb. n.', 'of Adhere'),
(1033, 'Adhere', 'v. i.', 'To stick fast or cleave, as a glutinous substance does;\n   to become joined or united; as, wax to the finger; the lungs sometimes\n   adhere to the pleura.'),
(1034, 'Adhere', 'v. i.', 'To hold, be attached, or devoted; to remain fixed,\n   either by personal union or conformity of faith, principle, or opinion;\n   as, men adhere to a party, a cause, a leader, a church.'),
(1035, 'Adhere', 'v. i.', 'To be consistent or coherent; to be in accordance; to\n   agree.'),
(1036, 'Adherent', 'a.', 'Sticking; clinging; adhering.'),
(1037, 'Adherent', 'a.', 'Attached as an attribute or circumstance.'),
(1038, 'Adherent', 'a.', 'Congenitally united with an organ of another kind, as\n   calyx with ovary, or stamens with petals.'),
(1039, 'Adherent', 'n.', 'One who adheres; one who adheres; one who follows a\n   leader, party, or profession; a follower, or partisan; a believer in a\n   particular faith or church.'),
(1040, 'Adherent', 'n.', 'That which adheres; an appendage.'),
(1041, 'Adherer', 'n.', 'One who adheres; an adherent.'),
(1042, 'Adhesion', 'n.', 'The action of sticking; the state of being attached;\n   intimate union; as, the adhesion of glue, or of parts united by growth,\n   cement, or the like.'),
(1043, 'Adhesion', 'n.', 'Adherence; steady or firm attachment; fidelity; as,\n   adhesion to error, to a policy.'),
(1044, 'Adhesion', 'n.', 'Agreement to adhere; concurrence; assent.'),
(1045, 'Adhesion', 'n.', 'The molecular attraction exerted between bodies in\n   contact. See Cohesion.'),
(1046, 'Adhesion', 'n.', 'Union of surface, normally separate, by the formation of\n   new tissue resulting from an inflammatory process.'),
(1047, 'Adhesion', 'n.', 'The union of parts which are separate in other plants, or\n   in younger states of the same plant.'),
(1048, 'Adhesive', 'a.', 'Sticky; tenacious, as glutinous substances.'),
(1049, 'Adhesive', 'a.', 'Apt or tending to adhere; clinging.'),
(1050, 'Adhibit', 'v. t.', 'To admit, as a person or thing; to take in.'),
(1051, 'Adhibit', 'v. t.', 'To use or apply; to administer.'),
(1052, 'Adhibit', 'v. t.', 'To attach; to affix.'),
(1053, 'Adhort', 'v. t.', 'To exhort; to advise.'),
(1054, 'Adiantum', 'n.', 'A genus of ferns, the leaves of which shed water;\n   maidenhair. Also, the black maidenhair, a species of spleenwort.'),
(1055, 'Adieu', 'interj. & adv.', 'Good-by; farewell; an expression of kind wishes\n   at parting.'),
(1056, 'Adieus', 'pl. ', 'of Adieu'),
(1057, 'Adieu', 'n.', 'A farewell; commendation to the care of God at parting.'),
(1058, 'Adight', 'p. p.', 'of Adight'),
(1059, 'Adight', 'v. t.', 'To set in order; to array; to attire; to deck, to dress.'),
(1060, 'Adipic', 'a.', 'Pertaining to, or derived from, fatty or oily substances;\n   -- applied to certain acids obtained from fats by the action of nitric\n   acid.'),
(1061, 'Adipose', 'a.', 'Of or pertaining to animal fat; fatty.'),
(1062, 'Adipous', 'a.', 'Fatty; adipose.'),
(1063, 'Adipsous', 'a.', 'Quenching thirst, as certain fruits.'),
(1064, 'Adipsy', 'n.', 'Absence of thirst.'),
(1065, 'Adjacent', 'a.', 'Lying near, close, or contiguous; neighboring; bordering\n   on; as, a field adjacent to the highway.'),
(1066, 'Adjacent', 'n.', 'That which is adjacent.'),
(1067, 'Adject', 'v. t.', 'To add or annex; to join.'),
(1068, 'Adjoined', 'imp. & p. p.', 'of Adjoin'),
(1069, 'Adjoin', 'v. t.', 'To join or unite to; to lie contiguous to; to be in\n   contact with; to attach; to append.'),
(1070, 'Adjoin', 'v. i.', 'To lie or be next, or in contact; to be contiguous; as,\n   the houses adjoin.'),
(1071, 'Adjoin', 'v. i.', 'To join one\'s self.'),
(1072, 'Adjoint', 'n.', 'An adjunct; a helper.'),
(1073, 'Adjourn', 'v. t.', 'To put off or defer to another day, or indefinitely; to\n   postpone; to close or suspend for the day; -- commonly said of the\n   meeting, or the action, of convened body; as, to adjourn the meeting;\n   to adjourn a debate.'),
(1074, 'Adjourn', 'v. i.', 'To suspend business for a time, as from one day to\n   another, or for a longer period, or indefinitely; usually, to suspend\n   public business, as of legislatures and courts, or other convened\n   bodies; as, congress adjourned at four o\'clock; the court adjourned\n   without day.'),
(1075, 'Adjudged', 'imp. & p. p.', 'of Adjudge'),
(1076, 'Adjudge', 'v. t.', 'To award judicially in the case of a controverted\n   question; as, the prize was adjudged to the victor.'),
(1077, 'Adjudge', 'v. t.', 'To determine in the exercise of judicial power; to\n   decide or award judicially; to adjudicate; as, the case was adjudged in\n   the November term.'),
(1078, 'Adjudge', 'v. t.', 'To sentence; to condemn.'),
(1079, 'Adjudge', 'v. t.', 'To regard or hold; to judge; to deem.'),
(1080, 'Adjudger', 'n.', 'One who adjudges.'),
(1081, 'Adjugate', 'v. t.', 'To yoke to.'),
(1082, 'Adjument', 'n.', 'Help; support; also, a helper.'),
(1083, 'Adjuvant', 'n.', 'A substance added to an immunogenic agent to enhance the\n   production of antibodies.'),
(1084, 'Adjuvant', 'n.', 'A substance added to a formulation of a drug which\n   enhances the effect of the active ingredient.'),
(1085, 'Adjunct', 'a.', 'Conjoined; attending; consequent.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(1086, 'Adjunct', 'n.', 'Something joined or added to another thing, but not\n   essentially a part of it.'),
(1087, 'Adjunct', 'n.', 'A person joined to another in some duty or service; a\n   colleague; an associate.'),
(1088, 'Adjunct', 'n.', 'A word or words added to quality or amplify the force of\n   other words; as, the History of the American Revolution, where the\n   words in italics are the adjunct or adjuncts of \"History.\"'),
(1089, 'Adjunct', 'n.', 'A quality or property of the body or the mind, whether\n   natural or acquired; as, color, in the body, judgment in the mind.'),
(1090, 'Adjunct', 'n.', 'A key or scale closely related to another as principal; a\n   relative or attendant key. [R.] See Attendant keys, under Attendant, a.'),
(1091, 'Adjured', 'imp. & p. p.', 'of Adjure'),
(1092, 'Adjuring', 'p. pr. & vb. n.', 'of Adjure'),
(1093, 'Adjure', 'v. t.', 'To charge, bind, or command, solemnly, as if under oath,\n   or under the penalty of a curse; to appeal to in the most solemn or\n   impressive manner; to entreat earnestly.'),
(1094, 'Adjurer', 'n.', 'One who adjures.'),
(1095, 'Adjusted', 'imp. & p. p.', 'of Adjust'),
(1096, 'Adjust', 'v. t.', 'To make exact; to fit; to make correspondent or\n   conformable; to bring into proper relations; as, to adjust a garment to\n   the body, or things to a standard.'),
(1097, 'Adjust', 'v. t.', 'To put in order; to regulate, or reduce to system.'),
(1098, 'Adjust', 'v. t.', 'To settle or bring to a satisfactory state, so that\n   parties are agreed in the result; as, to adjust accounts; the\n   differences are adjusted.'),
(1099, 'Adjust', 'v. t.', 'To bring to a true relative position, as the parts of an\n   instrument; to regulate for use; as, to adjust a telescope or\n   microscope.'),
(1100, 'Adjuster', 'n.', 'One who, or that which, adjusts.'),
(1101, 'Adjutage', 'n.', 'Same as Ajutage.'),
(1102, 'Adjutant', 'n.', 'A helper; an assistant.'),
(1103, 'Adjutant', 'n.', 'A regimental staff officer, who assists the colonel, or\n   commanding officer of a garrison or regiment, in the details of\n   regimental and garrison duty.'),
(1104, 'Adjutant', 'n.', 'A species of very large stork (Ciconia argala), a native\n   of India; -- called also the gigantic crane, and by the native name\n   argala. It is noted for its serpent-destroying habits.'),
(1105, 'Adjute', 'v. t.', 'To add.'),
(1106, 'Adjutor', 'n.', 'A helper or assistant.'),
(1107, 'Adjutory', 'a.', 'Serving to help or assist; helping.'),
(1108, 'Adjutrix', 'n.', 'A female helper or assistant.'),
(1109, 'Adjuvant', 'a.', 'Helping; helpful; assisting.'),
(1110, 'Adjuvant', 'n.', 'An assistant.'),
(1111, 'Adjuvant', 'n.', 'An ingredient, in a prescription, which aids or modifies\n   the action of the principal ingredient.'),
(1112, 'Admiral', 'n.', 'A naval officer of the highest rank; a naval officer of\n   high rank, of which there are different grades. The chief gradations in\n   rank are admiral, vice admiral, and rear admiral. The admiral is the\n   commander in chief of a fleet or of fleets.'),
(1113, 'Admiral', 'n.', 'The ship which carries the admiral; also, the most\n   considerable ship of a fleet.'),
(1114, 'Admiral', 'n.', 'A handsome butterfly (Pyrameis Atalanta) of Europe and\n   America. The larva feeds on nettles.'),
(1115, 'Admired', 'imp. & p. p.', 'of Admire'),
(1116, 'Admiring', 'p. pr. & vb. n.', 'of Admire'),
(1117, 'Admire', 'v. t.', 'To regard with wonder or astonishment; to view with\n   surprise; to marvel at.'),
(1118, 'Admire', 'v. t.', 'To regard with wonder and delight; to look upon with an\n   elevated feeling of pleasure, as something which calls out approbation,\n   esteem, love, or reverence; to estimate or prize highly; as, to admire\n   a person of high moral worth, to admire a landscape.'),
(1119, 'Admire', 'v. i.', 'To wonder; to marvel; to be affected with surprise; --\n   sometimes with at.'),
(1120, 'Admired', 'a.', 'Regarded with wonder and delight; highly prized; as, an\n   admired poem.'),
(1121, 'Admired', 'a.', 'Wonderful; also, admirable.'),
(1122, 'Admirer', 'n.', 'One who admires; one who esteems or loves greatly.'),
(1123, 'Admiring', 'a.', 'Expressing admiration; as, an admiring glance.'),
(1124, 'Admitted', 'imp. & p. p.', 'of Admit'),
(1125, 'Admit', 'v. t.', 'To suffer to enter; to grant entrance, whether into a\n   place, or into the mind, or consideration; to receive; to take; as,\n   they were into his house; to admit a serious thought into the mind; to\n   admit evidence in the trial of a cause.'),
(1126, 'Admit', 'v. t.', 'To give a right of entrance; as, a ticket admits one into\n   a playhouse.'),
(1127, 'Admit', 'v. t.', 'To allow (one) to enter on an office or to enjoy a\n   privilege; to recognize as qualified for a franchise; as, to admit an\n   attorney to practice law; the prisoner was admitted to bail.'),
(1128, 'Admit', 'v. t.', 'To concede as true; to acknowledge or assent to, as an\n   allegation which it is impossible to deny; to own or confess; as, the\n   argument or fact is admitted; he admitted his guilt.'),
(1129, 'Admit', 'v. t.', 'To be capable of; to permit; as, the words do not admit\n   such a construction. In this sense, of may be used after the verb, or\n   may be omitted.'),
(1130, 'Admitted', 'a.', 'Received as true or valid; acknowledged.'),
(1131, 'Admitter', 'n.', 'One who admits.'),
(1132, 'Admix', 'v. t.', 'To mingle with something else; to mix.'),
(1133, 'Admonish', 'v. t.', 'To warn or notify of a fault; to reprove gently or\n   kindly, but seriously; to exhort.'),
(1134, 'Admonish', 'v. t.', 'To counsel against wrong practices; to cation or\n   advise; to warn against danger or an offense; -- followed by of,\n   against, or a subordinate clause.'),
(1135, 'Admonish', 'v. t.', 'To instruct or direct; to inform; to notify.'),
(1136, 'Admove', 'v. t.', 'To move or conduct to or toward.'),
(1137, 'Adnate', 'a.', 'Grown to congenitally.'),
(1138, 'Adnate', 'a.', 'Growing together; -- said only of organic cohesion of\n   unlike parts.'),
(1139, 'Adnate', 'a.', 'Growing with one side adherent to a stem; -- a term applied\n   to the lateral zooids of corals and other compound animals.'),
(1140, 'Adnation', 'n.', 'The adhesion or cohesion of different floral verticils or\n   sets of organs.'),
(1141, 'Adnoun', 'n.', 'An adjective, or attribute.'),
(1142, 'Adobe', 'n.', 'An unburnt brick dried in the sun; also used as an\n   adjective, as, an adobe house, in Texas or New Mexico.'),
(1143, 'Adonean', 'a.', 'Pertaining to Adonis; Adonic.'),
(1144, 'Adonic', 'a.', 'Relating to Adonis, famed for his beauty.'),
(1145, 'Adonic', 'n.', 'An Adonic verse.'),
(1146, 'Adonis', 'n.', 'A youth beloved by Venus for his beauty. He was killed in\n   the chase by a wild boar.'),
(1147, 'Adonis', 'n.', 'A preeminently beautiful young man; a dandy.'),
(1148, 'Adonis', 'n.', 'A genus of plants of the family Ranunculaceae, containing\n   the pheasant\'s eye (Adonis autumnalis); -- named from Adonis, whose\n   blood was fabled to have stained the flower.'),
(1149, 'Adonist', 'n.', 'One who maintains that points of the Hebrew word\n   translated \"Jehovah\" are really the vowel points of the word \"Adonai.\"\n   See Jehovist.'),
(1150, 'Adonize', 'v. t.', 'To beautify; to dandify.'),
(1151, 'Adoor', '', 'Alt. of Adoors'),
(1152, 'Adoors', '', 'At the door; of the door; as, out adoors.'),
(1153, 'Adopted', 'imp. & p. p.', 'of Adopt'),
(1154, 'Adopting', 'p. pr. & vb. n.', 'of Adopt'),
(1155, 'Adopt', 'v. t.', 'To take by choice into relationship, as, child, heir,\n   friend, citizen, etc.; esp. to take voluntarily (a child of other\n   parents) to be in the place of, or as, one\'s own child.'),
(1156, 'Adopt', 'v. t.', 'To take or receive as one\'s own what is not so naturally;\n   to select and take or approve; as, to adopt the view or policy of\n   another; these resolutions were adopted.'),
(1157, 'Adopted', 'a.', 'Taken by adoption; taken up as one\'s own; as, an adopted\n   son, citizen, country, word.'),
(1158, 'Adopter', 'n.', 'One who adopts.'),
(1159, 'Adopter', 'n.', 'A receiver, with two necks, opposite to each other, one of\n   which admits the neck of a retort, and the other is joined to another\n   receiver. It is used in distillations, to give more space to elastic\n   vapors, to increase the length of the neck of a retort, or to unite two\n   vessels whose openings have different diameters.'),
(1160, 'Adoption', 'n.', 'The act of adopting, or state of being adopted; voluntary\n   acceptance of a child of other parents to be the same as one\'s own\n   child.'),
(1161, 'Adoption', 'n.', 'Admission to a more intimate relation; reception; as, the\n   adoption of persons into hospitals or monasteries, or of one society\n   into another.'),
(1162, 'Adoption', 'n.', 'The choosing and making that to be one\'s own which\n   originally was not so; acceptance; as, the adoption of opinions.'),
(1163, 'Adoptive', 'a.', 'Pertaining to adoption; made or acquired by adoption;\n   fitted to adopt; as, an adoptive father, an child; an adoptive\n   language.'),
(1164, 'Adorable', 'a.', 'Deserving to be adored; worthy of divine honors.'),
(1165, 'Adorable', 'a.', 'Worthy of the utmost love or respect.'),
(1166, 'Adorably', 'adv.', 'In an adorable manner.'),
(1167, 'Adoring', 'imp. & p. p. Adored ', '/); p. pr. & vb. n.) of Adore'),
(1168, 'Adore', 'v. t.', 'To worship with profound reverence; to pay divine honors\n   to; to honor as deity or as divine.'),
(1169, 'Adore', 'v. t.', 'To love in the highest degree; to regard with the utmost\n   esteem and affection; to idolize.'),
(1170, 'Adore', 'v. t.', 'To adorn.'),
(1171, 'Adorer', 'n.', 'One who adores; a worshiper; one who admires or loves\n   greatly; an ardent admirer.'),
(1172, 'Adorned', 'imp. & p. p.', 'of Adorn'),
(1173, 'Adorning', 'p. pr. & vb. n.', 'of Adorn'),
(1174, 'Adorn', 'v. t.', 'To deck or dress with ornaments; to embellish; to set off\n   to advantage; to render pleasing or attractive.'),
(1175, 'Adorn', 'n.', 'Adornment.'),
(1176, 'Adorn', 'a.', 'Adorned; decorated.'),
(1177, 'Adorner', 'n.', 'He who, or that which, adorns; a beautifier.'),
(1178, 'Adown', 'adv.', 'From a higher to a lower situation; downward; down, to or\n   on the ground.'),
(1179, 'Adown', 'prep.', 'Down.'),
(1180, 'Adpress', 'v. t.', 'See Appressed.'),
(1181, 'Adrad', 'p. a.', 'Put in dread; afraid.'),
(1182, 'Adragant', 'n.', 'Gum tragacanth.'),
(1183, 'Adread', 'v. t. & i.', 'To dread.'),
(1184, 'Adreamed', 'p. p.', 'Visited by a dream; -- used in the phrase, To be\n   adreamed, to dream.'),
(1185, 'Adrenal', 'a.', 'Suprarenal.'),
(1186, 'Adrian', 'a.', 'Pertaining to the Adriatic Sea; as, Adrian billows.'),
(1187, 'Adriatic', 'a.', 'Of or pertaining to a sea so named, the northwestern part\n   of which is known as the Gulf of Venice.'),
(1188, 'Adrift', 'adv. & a.', 'Floating at random; in a drifting condition; at the\n   mercy of wind and waves. Also fig.'),
(1189, 'Adrip', 'adv. & a.', 'In a dripping state; as, leaves all adrip.'),
(1190, 'Adrogate', 'v. t.', 'To adopt (a person who is his own master).'),
(1191, 'Adroit', 'a.', 'Dexterous in the use of the hands or in the exercise of the\n   mental faculties; exhibiting skill and readiness in avoiding danger or\n   escaping difficulty; ready in invention or execution; -- applied to\n   persons and to acts; as, an adroit mechanic, an adroit reply.'),
(1192, 'Adroitly', 'adv.', 'In an adroit manner.'),
(1193, 'Adscript', 'a.', 'Held to service as attached to the soil; -- said of\n   feudal serfs.'),
(1194, 'Adscript', 'n.', 'One held to service as attached to the glebe or estate; a\n   feudal serf.'),
(1195, 'Adstrict', 'n.', 'See Astrict, and Astriction.'),
(1196, 'Adularia', 'n.', 'A transparent or translucent variety of common feldspar,\n   or orthoclase, which often shows pearly opalescent reflections; --\n   called by lapidaries moonstone.'),
(1197, 'Adulate', 'v. t.', 'To flatter in a servile way.'),
(1198, 'Adulator', 'n.', 'A servile or hypocritical flatterer.'),
(1199, 'Adult', 'a.', 'Having arrived at maturity, or to full size and strength;\n   matured; as, an adult person or plant; an adult ape; an adult age.'),
(1200, 'Adult', 'n.', 'A person, animal, or plant grown to full size and strength;\n   one who has reached maturity.'),
(1201, 'Adulter', 'v. i.', 'To commit adultery; to pollute.'),
(1202, 'Adultery', 'n.', 'The unfaithfulness of a married person to the marriage\n   bed; sexual intercourse by a married man with another than his wife, or\n   voluntary sexual intercourse by a married woman with another than her\n   husband.'),
(1203, 'Adultery', 'n.', 'Adulteration; corruption.'),
(1204, 'Adultery', 'n.', 'Lewdness or unchastity of thought as well as act, as\n   forbidden by the seventh commandment.'),
(1205, 'Adultery', 'n.', 'Faithlessness in religion.'),
(1206, 'Adultery', 'n.', 'The fine and penalty imposed for the offense of adultery.'),
(1207, 'Adultery', 'n.', 'The intrusion of a person into a bishopric during the\n   life of the bishop.'),
(1208, 'Adultery', 'n.', 'Injury; degradation; ruin.'),
(1209, 'Adunc', 'a.', 'Alt. of Adunque'),
(1210, 'Adunque', 'a.', 'Hooked; as, a parrot has an adunc bill.'),
(1211, 'Aduncity', 'n.', 'Curvature inwards; hookedness.'),
(1212, 'Aduncous', 'a.', 'Curved inwards; hooked.'),
(1213, 'Adure', 'v. t.', 'To burn up.'),
(1214, 'Adust', 'a.', 'Inflamed or scorched; fiery.'),
(1215, 'Adust', 'a.', 'Looking as if or scorched; sunburnt.'),
(1216, 'Adust', 'a.', 'Having much heat in the constitution and little serum in the\n   blood. [Obs.] Hence: Atrabilious; sallow; gloomy.'),
(1217, 'Adusted', 'a.', 'Burnt; adust.'),
(1218, 'Adustion', 'n.', 'The act of burning, or heating to dryness; the state of\n   being thus heated or dried.'),
(1219, 'Adustion', 'n.', 'Cauterization.'),
(1220, 'Advanced', 'imp. & p. p.', 'of Advance'),
(1221, 'Advance', 'v. t.', 'To bring forward; to move towards the van or front; to\n   make to go on.'),
(1222, 'Advance', 'v. t.', 'To raise; to elevate.'),
(1223, 'Advance', 'v. t.', 'To raise to a higher rank; to promote.'),
