(1239, 'Advanced', 'a.', 'In the van or front.'),
(1240, 'Advanced', 'a.', 'In the front or before others, as regards progress or\n   ideas; as, advanced opinions, advanced thinkers.'),
(1241, 'Advanced', 'a.', 'Far on in life or time.'),
(1242, 'Advancer', 'n.', 'One who advances; a promoter.'),
(1243, 'Advancer', 'n.', 'A second branch of a buck\'s antler.'),
(1244, 'Advene', 'v. i.', 'To accede, or come (to); to be added to something or\n   become a part of it, though not essential.'),
