(1248, 'Adverb', 'n.', 'A word used to modify the sense of a verb, participle,\n   adjective, or other adverb, and usually placed near it; as, he writes\n   well; paper extremely white.'),
(1249, 'Adverse', 'a.', 'Acting against, or in a contrary direction; opposed;\n   contrary; opposite; conflicting; as, adverse winds; an adverse party; a\n   spirit adverse to distinctions of caste.'),
(1250, 'Adverse', 'a.', 'Opposite.'),
(1251, 'Adverse', 'a.', 'In hostile opposition to; unfavorable; unpropitious;\n   contrary to one\'s wishes; unfortunate; calamitous; afflictive; hurtful;\n   as, adverse fates, adverse circumstances, things adverse.'),
(1252, 'Adverse', 'v. t.', 'To oppose; to resist.'),
(1253, 'Adverted', 'imp. & p. p.', 'of Advert'),
(1254, 'Advert', 'v. i.', 'To turn the mind or attention; to refer; to take heed or\n   notice; -- with to; as, he adverted to what was said.'),
(1255, 'Advice', 'n.', 'An opinion recommended or offered, as worthy to be\n   followed; counsel.'),
(1256, 'Advice', 'n.', 'Deliberate consideration; knowledge.'),
(1257, 'Advice', 'n.', 'Information or notice given; intelligence; as, late advices\n   from France; -- commonly in the plural.'),
(1258, 'Advice', 'n.', 'Counseling to perform a specific illegal act.'),
(1259, 'Advised', 'imp. & p. p.', 'of Advise'),
(1260, 'Advising', 'p. pr. & vb. n.', 'of Advise'),
(1261, 'Advise', 'v. t.', 'To give advice to; to offer an opinion, as worthy or\n   expedient to be followed; to counsel; to warn.'),
(1262, 'Advise', 'v. t.', 'To give information or notice to; to inform; -- with of\n   before the thing communicated; as, we were advised of the risk.'),
(1263, 'Advise', 'v. t.', 'To consider; to deliberate.'),
