(1287, 'Aecidia', 'pl. ', 'of Aecidium'),
(1288, 'Aecidium', 'n.', 'A form of fruit in the cycle of development of the Rusts\n   or Brands, an order of fungi, formerly considered independent plants.'),
(1289, 'Aedile', 'n.', 'A magistrate in ancient Rome, who had the superintendence\n   of public buildings, highways, shows, etc.; hence, a municipal officer.'),
