(1309, 'Aeration', 'n.', 'A change produced in the blood by exposure to the air in\n   respiration; oxygenation of the blood in respiration; arterialization.'),
(1310, 'Aeration', 'n.', 'The act or preparation of charging with carbonic acid gas\n   or with oxygen.'),
(1311, 'Aerator', 'n.', 'That which supplies with air; esp. an apparatus used for\n   charging mineral waters with gas and in making soda water.'),
(1312, 'Aerial', 'a.', 'Of or pertaining to the air, or atmosphere; inhabiting or\n   frequenting the air; produced by or found in the air; performed in the\n   air; as, aerial regions or currents.'),
