(1314, 'Aerial', 'a.', 'Rising aloft in air; high; lofty; as, aerial spires.'),
(1315, 'Aerial', 'a.', 'Growing, forming, or existing in the air, as opposed to\n   growing or existing in earth or water, or underground; as, aerial\n   rootlets, aerial plants.'),
