(1317, 'Aerially', 'adv.', 'Like, or from, the air; in an aerial manner.'),
(1318, 'Aerie', 'n.', 'The nest of a bird of prey, as of an eagle or hawk; also a\n   brood of such birds; eyrie. Shak. Also fig.: A human residence or\n   resting place perched like an eagle\'s nest.'),
