(1345, 'Affable', 'a.', 'Easy to be spoken to or addressed; receiving others kindly\n   and conversing with them in a free and friendly manner; courteous;\n   sociable.'),
(1346, 'Affable', 'a.', 'Gracious; mild; benign.'),
