(1363, 'Affect', 'v. t.', 'To make a show of; to put on a pretense of; to feign; to\n   assume; as, to affect ignorance.'),
(1364, 'Affect', 'v. t.', 'To assign; to appoint.'),
(1365, 'Affect', 'n.', 'Affection; inclination; passion; feeling; disposition.'),
(1366, 'Affected', 'p. p. & a.', 'Regarded with affection; beloved.'),
(1367, 'Affected', 'p. p. & a.', 'Inclined; disposed; attached.'),
(1368, 'Affected', 'p. p. & a.', 'Given to false show; assuming or pretending to\n   possess what is not natural or real.'),
(1369, 'Affected', 'p. p. & a.', 'Assumed artificially; not natural.'),
