(1399, 'Affixed', 'imp. & p. p.', 'of Affix'),
(1400, 'Affixing', 'p. pr. & vb. n.', 'of Affix'),
(1401, 'Affix', 'v. t.', 'To subjoin, annex, or add at the close or end; to append\n   to; to fix to any part of; as, to affix a syllable to a word; to affix\n   a seal to an instrument; to affix one\'s name to a writing.'),
(1402, 'Affix', 'v. t.', 'To fix or fasten in any way; to attach physically.'),
(1403, 'Affix', 'v. t.', 'To attach, unite, or connect with; as, names affixed to\n   ideas, or ideas affixed to things; to affix a stigma to a person; to\n   affix ridicule or blame to any one.'),
(1404, 'Affix', 'v. t.', 'To fix or fasten figuratively; -- with on or upon; as,\n   eyes affixed upon the ground.'),
(1405, 'Affixes', 'pl. ', 'of Affix'),
(1406, 'Affix', 'n.', 'That which is affixed; an appendage; esp. one or more\n   letters or syllables added at the end of a word; a suffix; a postfix.'),
(1407, 'Affixion', 'n.', 'Affixture.'),
(1408, 'Afflatus', 'n.', 'A breath or blast of wind.'),
(1409, 'Afflatus', 'n.', 'A divine impartation of knowledge; supernatural impulse;\n   inspiration.'),
(1410, 'Afflict', 'v. t.', 'To strike or cast down; to overthrow.'),
(1411, 'Afflict', 'v. t.', 'To inflict some great injury or hurt upon, causing\n   continued pain or mental distress; to trouble grievously; to torment.'),
(1412, 'Afflict', 'v. t.', 'To make low or humble.'),
(1413, 'Afflict', 'p. p. & a.', 'Afflicted.'),
(1414, 'Affluent', 'a.', 'Flowing to; flowing abundantly.'),
(1415, 'Affluent', 'a.', 'Abundant; copious; plenteous; hence, wealthy; abounding\n   in goods or riches.'),
(1416, 'Affluent', 'n.', 'A stream or river flowing into a larger river or into a\n   lake; a tributary stream.'),
(1417, 'Afflux', 'n.', 'A flowing towards; that which flows to; as, an afflux of\n   blood to the head.'),
(1418, 'Affodill', 'n.', 'Asphodel.'),
(1419, 'Afforce', 'v. t.', 'To reenforce; to strengthen.'),
(1420, 'Afforded', 'imp. & p. p.', 'of Afford'),
