(1426, 'Affrap', 'v. t. & i.', 'To strike, or strike down.'),
(1427, 'Affrayed', 'p. p.', 'of Affray'),
(1428, 'Affray', 'v. t.', 'To startle from quiet; to alarm.'),
(1429, 'Affray', 'v. t.', 'To frighten; to scare; to frighten away.'),
(1430, 'Affray', 'v. t.', 'The act of suddenly disturbing any one; an assault or\n   attack.'),
(1431, 'Affray', 'v. t.', 'Alarm; terror; fright.'),
(1432, 'Affray', 'v. t.', 'A tumultuous assault or quarrel; a brawl; a fray.'),
