(1434, 'Affrayer', 'n.', 'One engaged in an affray.'),
(1435, 'Affret', 'n.', 'A furious onset or attack.'),
(1436, 'Affright', 'v. t.', 'To impress with sudden fear; to frighten; to alarm.'),
(1437, 'Affright', 'p. a.', 'Affrighted.'),
(1438, 'Affright', 'n.', 'Sudden and great fear; terror. It expresses a stronger\n   impression than fear, or apprehension, perhaps less than terror.'),
(1439, 'Affright', 'n.', 'The act of frightening; also, a cause of terror; an\n   object of dread.'),
(1440, 'Affront', 'v. t.', 'To front; to face in position; to meet or encounter\n   face to face.'),
