(1446, 'Affronte', 'a.', 'Face to face, or front to front; facing.'),
(1447, 'Affused', 'imp. & p. p.', 'of Affuse'),
(1448, 'Affusing', 'p. pr. & vb. n.', 'of Affuse'),
(1449, 'Affuse', 'v. t.', 'To pour out or upon.'),
