(1452, 'Affied', 'imp. & p. p.', 'of Affy'),
(1453, 'Affying', 'p. pr.', 'of Affy'),
(1454, 'Afghan', 'a.', 'Of or pertaining to Afghanistan.'),
(1455, 'Afghan', 'n.', 'A native of Afghanistan.'),
(1456, 'Afghan', 'n.', 'A kind of worsted blanket or wrap.'),
(1457, 'Afield', 'adv.', 'To, in, or on the field.'),
(1458, 'Afield', 'adv.', 'Out of the way; astray.'),
(1459, 'Afire', 'adv. & a.', 'On fire.'),
(1460, 'Aflame', 'adv. & a.', 'Inflames; glowing with light or passion; ablaze.'),
(1461, 'Aflat', 'adv.', 'Level with the ground; flat.'),
(1462, 'Aflaunt', 'adv. & a.', 'In a flaunting state or position.'),
(1463, 'Aflicker', 'adv. & a.', 'In a flickering state.'),
(1464, 'Afloat', 'adv. & a.', 'Borne on the water; floating; on board ship.'),
(1465, 'Afloat', 'adv. & a.', 'Moving; passing from place to place; in general\n   circulation; as, a rumor is afloat.'),
(1466, 'Afloat', 'adv. & a.', 'Unfixed; moving without guide or control; adrift;\n   as, our affairs are all afloat.'),
(1467, 'Aflow', 'adv. & a.', 'Flowing.'),
(1468, 'Aflush', 'adv. & a.', 'In a flushed or blushing state.'),
(1469, 'Aflush', 'adv. & a.', 'On a level.'),
(1470, 'Aflutter', 'adv. & a.', 'In a flutter; agitated.'),
(1471, 'Afoam', 'adv. & a.', 'In a foaming state; as, the sea is all afoam.'),
(1472, 'Afoot', 'adv.', 'On foot.'),
(1473, 'Afoot', 'adv.', 'Fig.: In motion; in action; astir; in progress.'),
(1474, 'Afore', 'adv.', 'Before.'),
(1475, 'Afore', 'adv.', 'In the fore part of a vessel.'),
(1476, 'Afore', 'prep.', 'Before (in all its senses).'),
(1477, 'Afore', 'prep.', 'Before; in front of; farther forward than; as, afore the\n   windlass.'),
(1478, 'Afoul', 'adv. & a.', 'In collision; entangled.'),
(1479, 'Afraid', 'p. a.', 'Impressed with fear or apprehension; in fear;\n   apprehensive.'),
(1480, 'Afreet', 'n.', 'Same as Afrit.'),
(1481, 'Afresh', 'adv.', 'Anew; again; once more; newly.'),
(1482, 'Afric', 'a.', 'African.'),
(1483, 'Afric', 'n.', 'Africa.'),
(1484, 'African', 'a.', 'Of or pertaining to Africa.'),
(1485, 'African', 'n.', 'A native of Africa; also one ethnologically belonging to\n   an African race.'),
(1486, 'Afrit', 'n.', 'Alt. of Afreet'),
(1487, 'Afrite', 'n.', 'Alt. of Afreet'),
(1488, 'Afreet', 'n.', 'A powerful evil jinnee, demon, or monstrous giant.'),
(1489, 'Afront', 'adv.', 'In front; face to face.'),
(1490, 'Afront', 'prep.', 'In front of.'),
(1491, 'After', 'a.', 'Next; later in time; subsequent; succeeding; as, an after\n   period of life.'),
(1492, 'After', 'a.', 'Hinder; nearer the rear.'),
(1493, 'After', 'a.', 'To ward the stern of the ship; -- applied to any object in\n   the rear part of a vessel; as the after cabin, after hatchway.'),
(1494, 'After', 'prep.', 'Behind in place; as, men in line one after another.'),
(1495, 'After', 'prep.', 'Below in rank; next to in order.'),
(1496, 'After', 'prep.', 'Later in time; subsequent; as, after supper, after three\n   days. It often precedes a clause. Formerly that was interposed between\n   it and the clause.'),
(1497, 'After', 'prep.', 'Subsequent to and in consequence of; as, after what you\n   have said, I shall be careful.'),
(1498, 'After', 'prep.', 'Subsequent to and notwithstanding; as, after all our\n   advice, you took that course.'),
(1499, 'After', 'prep.', 'Moving toward from behind; following, in search of; in\n   pursuit of.'),
(1500, 'After', 'prep.', 'Denoting the aim or object; concerning; in relation to;\n   as, to look after workmen; to inquire after a friend; to thirst after\n   righteousness.'),
(1501, 'After', 'prep.', 'In imitation of; in conformity with; after the manner of;\n   as, to make a thing after a model; a picture after Rubens; the boy\n   takes after his father.'),
(1502, 'After', 'prep.', 'According to; in accordance with; in conformity with the\n   nature of; as, he acted after his kind.'),
(1503, 'After', 'prep.', 'According to the direction and influence of; in\n   proportion to; befitting.'),
(1504, 'After', 'adv.', 'Subsequently in time or place; behind; afterward; as, he\n   follows after.'),
(1505, 'Aftereye', 'v. t.', 'To look after.'),
(1506, 'Aftmost', 'a.', 'Nearest the stern.'),
(1507, 'Aftward', 'adv.', 'Toward the stern.'),
(1508, 'Again', 'adv.', 'In return, back; as, bring us word again.'),
(1509, 'Again', 'adv.', 'Another time; once more; anew.'),
(1510, 'Again', 'adv.', 'Once repeated; -- of quantity; as, as large again, half as\n   much again.'),
(1511, 'Again', 'adv.', 'In any other place.'),
(1512, 'Again', 'adv.', 'On the other hand.'),
(1513, 'Again', 'adv.', 'Moreover; besides; further.'),
(1514, 'Again', 'prep.', 'Alt. of Agains'),
(1515, 'Agains', 'prep.', 'Against; also, towards (in order to meet).'),
(1516, 'Againbuy', 'v. t.', 'To redeem.'),
(1517, 'Againsay', 'v. t.', 'To gainsay.'),
(1518, 'Against', 'prep.', 'Abreast; opposite to; facing; towards; as, against the\n   mouth of a river; -- in this sense often preceded by over.'),
(1519, 'Against', 'prep.', 'From an opposite direction so as to strike or come in\n   contact with; in contact with; upon; as, hail beats against the roof.'),
(1520, 'Against', 'prep.', 'In opposition to, whether the opposition is of\n   sentiment or of action; on the other side; counter to; in contrariety\n   to; hence, adverse to; as, against reason; against law; to run a race\n   against time.'),
(1521, 'Against', 'prep.', 'By of before the time that; in preparation for; so as\n   to be ready for the time when.'),
(1522, 'Agalaxy', 'n.', 'Failure of the due secretion of milk after childbirth.'),
(1523, 'Agalloch', 'n.', 'Alt. of Agallochum'),
(1524, 'Agama', 'n.', 'A genus of lizards, one of the few which feed upon vegetable\n   substances; also, one of these lizards.'),
(1525, 'Agamis', 'pl. ', 'of Agami'),
(1526, 'Agami', 'n.', 'A South American bird (Psophia crepitans), allied to the\n   cranes, and easily domesticated; -- called also the gold-breasted\n   trumpeter. Its body is about the size of the pheasant. See Trumpeter.'),
(1527, 'Agamic', 'a.', 'Produced without sexual union; as, agamic or unfertilized\n   eggs.'),
(1528, 'Agamic', 'a.', 'Not having visible organs of reproduction, as flowerless\n   plants; agamous.'),
(1529, 'Agamist', 'n.', 'An unmarried person; also, one opposed to marriage.'),
(1530, 'Agamous', 'a.', 'Having no visible sexual organs; asexual.'),
(1531, 'Agamous', 'a.', 'cryptogamous.'),
(1532, 'Agape', 'adv. & a.', 'Gaping, as with wonder, expectation, or eager\n   attention.'),
(1533, 'Agapae', 'pl. ', 'of Agape'),
(1534, 'Agape', 'n.', 'The love feast of the primitive Christians, being a meal\n   partaken of in connection with the communion.'),
(1535, 'Agaric', 'n.', 'A fungus of the genus Agaricus, of many species, of which\n   the common mushroom is an example.'),
(1536, 'Agaric', 'n.', 'An old name for several species of Polyporus, corky fungi\n   growing on decaying wood.'),
(1537, 'Agasp', 'adv. & a.', 'In a state of gasping.'),
(1538, 'Agast', 'v. t.', 'Alt. of Aghast'),
(1539, 'Aghast', 'v. t.', 'To affright; to terrify.'),
(1540, 'Agast', 'p. p. & a.', 'See Aghast.'),
(1541, 'Agastric', 'a.', 'Having to stomach, or distinct digestive canal, as the\n   tapeworm.'),
(1542, 'Agate', 'adv.', 'On the way; agoing; as, to be agate; to set the bells\n   agate.'),
(1543, 'Agate', 'n.', 'A semipellucid, uncrystallized variety of quartz, presenting\n   various tints in the same specimen. Its colors are delicately arranged\n   in stripes or bands, or blended in clouds.'),
(1544, 'Agate', 'n.', 'A kind of type, larger than pearl and smaller than\n   nonpareil; in England called ruby.'),
(1545, 'Agate', 'n.', 'A diminutive person; so called in allusion to the small\n   figures cut in agate for rings and seals.'),
(1546, 'Agate', 'n.', 'A tool used by gold-wire drawers, bookbinders, etc.; -- so\n   called from the agate fixed in it for burnishing.'),
(1547, 'Agatine', 'a.', 'Pertaining to, or like, agate.'),
(1548, 'Agatize', 'v. t.', 'To convert into agate; to make resemble agate.'),
(1549, 'Agaty', 'a.', 'Of the nature of agate, or containing agate.'),
(1550, 'Agave', 'n.', 'A genus of plants (order Amaryllidaceae) of which the chief\n   species is the maguey or century plant (A. Americana), wrongly called\n   Aloe. It is from ten to seventy years, according to climate, in\n   attaining maturity, when it produces a gigantic flower stem, sometimes\n   forty feet in height, and perishes. The fermented juice is the pulque\n   of the Mexicans; distilled, it yields mescal. A strong thread and a\n   tough paper are made from the leaves, and the wood has many uses.'),
(1551, 'Agazed', 'p. p.', 'Gazing with astonishment; amazed.'),
(1552, 'Aging', 'p. pr. & vb. n.', 'of Age'),
(1553, 'Agedly', 'adv.', 'In the manner of an aged person.'),
(1554, 'Agedness', 'n.', 'The quality of being aged; oldness.'),
(1555, 'Ageless', 'a.', 'Without old age limits of duration; as, fountains of\n   ageless youth.'),
(1556, 'Agencies', 'pl. ', 'of Agency'),
(1557, 'Agency', 'n.', 'The faculty of acting or of exerting power; the state of\n   being in action; action; instrumentality.'),
(1558, 'Agency', 'n.', 'The office of an agent, or factor; the relation between a\n   principal and his agent; business of one intrusted with the concerns of\n   another.'),
(1559, 'Agency', 'n.', 'The place of business of am agent.'),
(1560, 'Agend', 'n.', 'See Agendum.'),
(1561, 'Agenda', 'pl. ', 'of Agendum'),
(1562, 'Agendum', 'n.', 'Something to be done; in the pl., a memorandum book.'),
(1563, 'Agendum', 'n.', 'A church service; a ritual or liturgy. [In this sense,\n   usually Agenda.]'),
(1564, 'Agenesic', 'a.', 'Characterized by sterility; infecund.'),
(1565, 'Agenesis', 'n.', 'Any imperfect development of the body, or any anomaly of\n   organization.'),
(1566, 'Agent', 'a.', 'Acting; -- opposed to patient, or sustaining, action.'),
(1567, 'Agent', 'n.', 'One who exerts power, or has the power to act; an actor.'),
(1568, 'Agent', 'n.', 'One who acts for, or in the place of, another, by authority\n   from him; one intrusted with the business of another; a substitute; a\n   deputy; a factor.'),
(1569, 'Agent', 'n.', 'An active power or cause; that which has the power to\n   produce an effect; as, a physical, chemical, or medicinal agent; as,\n   heat is a powerful agent.'),
(1570, 'Agential', 'a.', 'Of or pertaining to an agent or an agency.'),
(1571, 'Ageratum', 'n.', 'A genus of plants, one species of which (A. Mexicanum)\n   has lavender-blue flowers in dense clusters.'),
(1572, 'Agger', 'n.', 'An earthwork; a mound; a raised work.'),
(1573, 'Aggerate', 'v. t.', 'To heap up.'),
(1574, 'Aggerose', 'a.', 'In heaps; full of heaps.'),
(1575, 'Aggest', 'v. t.', 'To heap up.'),
(1576, 'Aggrace', 'v. t.', 'To favor; to grace.'),
(1577, 'Aggrace', 'n.', 'Grace; favor.'),
(1578, 'Aggrate', 'a.', 'To please.'),
(1579, 'Aggrege', 'v. t.', 'To make heavy; to aggravate.'),
(1580, 'Aggress', 'v. i.', 'To commit the first act of hostility or offense; to\n   begin a quarrel or controversy; to make an attack; -- with on.'),
(1581, 'Aggress', 'v. t.', 'To set upon; to attack.'),
(1582, 'Aggress', 'n.', 'Aggression.'),
(1583, 'Aggrieve', 'v. t.', 'To give pain or sorrow to; to afflict; hence, to\n   oppress or injure in one\'s rights; to bear heavily upon; -- now\n   commonly used in the passive TO be aggrieved.'),
(1584, 'Aggrieve', 'v. i.', 'To grieve; to lament.'),
(1585, 'Aggroup', 'v. t.', 'To bring together in a group; to group.'),
(1586, 'Aggry', 'a.', 'Alt. of Aggri'),
(1587, 'Aggri', 'a.', 'Applied to a kind of variegated glass beads of ancient\n   manufacture; as, aggry beads are found in Ashantee and Fantee in\n   Africa.'),
(1588, 'Aghast', 'v. t.', 'See Agast, v. t.'),
(1589, 'Aghast', 'a & p. p.', 'Terrified; struck with amazement; showing signs of\n   terror or horror.'),
(1590, 'Agible', 'a.', 'Possible to be done; practicable.'),
(1591, 'Agile', 'a.', 'Having the faculty of quick motion in the limbs; apt or\n   ready to move; nimble; active; as, an agile boy; an agile tongue.'),
(1592, 'Agilely', 'adv.', 'In an agile manner; nimbly.'),
(1593, 'Agility', 'n.', 'The quality of being agile; the power of moving the limbs\n   quickly and easily; nimbleness; activity; quickness of motion; as,\n   strength and agility of body.'),
(1594, 'Agility', 'n.', 'Activity; powerful agency.'),
(1595, 'Agios', 'pl. ', 'of Agio'),
(1596, 'Agiotage', 'n.', 'Exchange business; also, stockjobbing; the maneuvers of\n   speculators to raise or lower the price of stocks or public funds.'),
(1597, 'Agist', 'v. t.', 'To take to graze or pasture, at a certain sum; -- used\n   originally of the feeding of cattle in the king\'s forests, and\n   collecting the money for the same.'),
(1598, 'Agister', 'n.', 'Alt. of Agistor'),
(1599, 'Agistor', 'n.', 'Formerly, an officer of the king\'s forest, who had the\n   care of cattle agisted, and collected the money for the same; -- hence\n   called gisttaker, which in England is corrupted into guest-taker.'),
(1600, 'Agistor', 'n.', 'Now, one who agists or takes in cattle to pasture at a\n   certain rate; a pasturer.'),
(1601, 'Agitable', 'a.', 'Capable of being agitated, or easily moved.'),
(1602, 'Agitated', 'imp. & p. p.', 'of Agitate'),
(1603, 'Agitate', 'v. t.', 'To move with a violent, irregular action; as, the wind\n   agitates the sea; to agitate water in a vessel.'),
(1604, 'Agitate', 'v. t.', 'To move or actuate.'),
(1605, 'Agitate', 'v. t.', 'To stir up; to disturb or excite; to perturb; as, he\n   was greatly agitated.'),
(1606, 'Agitate', 'v. t.', 'To discuss with great earnestness; to debate; as, a\n   controversy hotly agitated.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(1607, 'Agitate', 'v. t.', 'To revolve in the mind, or view in all its aspects; to\n   contrive busily; to devise; to plot; as, politicians agitate desperate\n   designs.'),
(1608, 'Agitato', 'a.', 'Sung or played in a restless, hurried, and spasmodic\n   manner.'),
(1609, 'Agitator', 'n.', 'One who agitates; one who stirs up or excites others; as,\n   political reformers and agitators.'),
(1610, 'Agitator', 'n.', 'One of a body of men appointed by the army, in Cromwell\'s\n   time, to look after their interests; -- called also adjutators.'),
(1611, 'Agitator', 'n.', 'An implement for shaking or mixing.'),
(1612, 'Agleam', 'adv. & a.', 'Gleaming; as, faces agleam.'),
(1613, 'Aglet', 'n.', 'Alt. of Aiglet'),
(1614, 'Aiglet', 'n.', 'A tag of a lace or of the points, braids, or cords formerly\n   used in dress. They were sometimes formed into small images. Hence,\n   \"aglet baby\" (Shak.), an aglet image.'),
(1615, 'Aiglet', 'n.', 'A round white staylace.'),
(1616, 'Agley', 'adv.', 'Aside; askew.'),
(1617, 'Aglimmer', 'adv. & a.', 'In a glimmering state.'),
(1618, 'Aglitter', 'adv. & a.', 'Glittering; in a glitter.'),
(1619, 'Aglossal', 'a.', 'Without tongue; tongueless.'),
(1620, 'Aglow', 'adv. & a.', 'In a glow; glowing; as, cheeks aglow; the landscape\n   all aglow.'),
(1621, 'Agminal', 'a.', 'Pertaining to an army marching, or to a train.'),
(1622, 'Agminate', 'a.', 'Alt. of Agminated'),
(1623, 'Agnail', 'n.', 'A corn on the toe or foot.'),
(1624, 'Agnail', 'n.', 'An inflammation or sore under or around the nail; also, a\n   hangnail.'),
(1625, 'Agnate', 'a.', 'Related or akin by the father\'s side; also, sprung from the\n   same male ancestor.'),
(1626, 'Agnate', 'a.', 'Allied; akin.'),
(1627, 'Agnate', 'n.', 'A relative whose relationship can be traced exclusively\n   through males.'),
(1628, 'Agnatic', 'a.', 'Pertaining to descent by the male line of ancestors.'),
(1629, 'Agnation', 'n.', 'Consanguinity by a line of males only, as distinguished\n   from cognation.'),
(1630, 'Agnition', 'n.', 'Acknowledgment.'),
(1631, 'Agnize', 'v. t.', 'To recognize; to acknowledge.'),
(1632, 'Agnomen', 'n.', 'An additional or fourth name given by the Romans, on\n   account of some remarkable exploit or event; as, Publius Caius Scipio\n   Africanus.'),
(1633, 'Agnomen', 'n.', 'An additional name, or an epithet appended to a name; as,\n   Aristides the Just.'),
(1634, 'Agnostic', 'a.', 'Professing ignorance; involving no dogmatic; pertaining\n   to or involving agnosticism.'),
(1635, 'Agnostic', 'n.', 'One who professes ignorance, or denies that we have any\n   knowledge, save of phenomena; one who supports agnosticism, neither\n   affirming nor denying the existence of a personal Deity, a future life,\n   etc.'),
(1636, 'Agnuses', 'pl. ', 'of Agnus'),
(1637, 'Agnus', 'n.', 'Agnus Dei.'),
(1638, 'Agoing', 'adv.', 'In motion; in the act of going; as, to set a mill agoing.'),
(1639, 'Agones', 'pl. ', 'of Agon'),
(1640, 'Agone', 'a. & adv.', 'Ago.'),
(1641, 'Agone', 'n.', 'Agonic line.'),
(1642, 'Agonic', 'a.', 'Not forming an angle.'),
(1643, 'Agonism', 'n.', 'Contention for a prize; a contest.'),
(1644, 'Agonist', 'n.', 'One who contends for the prize in public games.'),
(1645, 'Agonized', 'imp. & p. p.', 'of Agonize'),
(1646, 'Agonize', 'v. i.', 'To writhe with agony; to suffer violent anguish.'),
(1647, 'Agonize', 'v. i.', 'To struggle; to wrestle; to strive desperately.'),
(1648, 'Agonize', 'v. t.', 'To cause to suffer agony; to subject to extreme pain;\n   to torture.'),
(1649, 'Agonies', 'pl. ', 'of Agony'),
(1650, 'Agony', 'n.', 'Violent contest or striving.'),
(1651, 'Agony', 'n.', 'Pain so extreme as to cause writhing or contortions of the\n   body, similar to those made in the athletic contests in Greece; and\n   hence, extreme pain of mind or body; anguish; paroxysm of grief;\n   specifically, the sufferings of Christ in the garden of Gethsemane.'),
(1652, 'Agony', 'n.', 'Paroxysm of joy; keen emotion.'),
(1653, 'Agony', 'n.', 'The last struggle of life; death struggle.'),
(1654, 'Agood', 'adv.', 'In earnest; heartily.'),
(1655, 'Agora', 'n.', 'An assembly; hence, the place of assembly, especially the\n   market place, in an ancient Greek city.'),
(1656, 'Agouara', 'n.', 'The crab-eating raccoon (Procyon cancrivorus), found in\n   the tropical parts of America.'),
(1657, 'Agouta', 'n.', 'A small insectivorous mammal (Solenodon paradoxus), allied\n   to the moles, found only in Hayti.'),
(1658, 'Agouti', 'n.', 'Alt. of Agouty'),
(1659, 'Agouty', 'n.', 'A rodent of the genus Dasyprocta, about the size of a\n   rabbit, peculiar to South America and the West Indies. The most common\n   species is the Dasyprocta agouti.'),
(1660, 'Agrace', 'n. & v.', 'See Aggrace.'),
(1661, 'Agraffe', 'n.', 'A hook or clasp.'),
(1662, 'Agraffe', 'n.', 'A hook, eyelet, or other device by which a piano wire is\n   so held as to limit the vibration.'),
(1663, 'Agraphia', 'n.', 'The absence or loss of the power of expressing ideas by\n   written signs. It is one form of aphasia.'),
(1664, 'Agraphic', 'a.', 'Characterized by agraphia.'),
(1665, 'Agrappes', 'n. pl.', 'Hooks and eyes for armor, etc.'),
(1666, 'Agrarian', 'a.', 'Pertaining to fields, or lands, or their tenure; esp.,\n   relating to an equal or equitable division of lands; as, the agrarian\n   laws of Rome, which distributed the conquered and other public lands\n   among citizens.'),
(1667, 'Agrarian', 'a.', 'Wild; -- said of plants growing in the fields.'),
(1668, 'Agrarian', 'n.', 'One in favor of an equal division of landed property.'),
(1669, 'Agrarian', 'n.', 'An agrarian law.'),
(1670, 'Agree', 'adv.', 'In good part; kindly.'),
(1671, 'Agreed', 'imp. & p. p.', 'of Agree'),
(1672, 'Agreeing', 'p. pr. & vb. n.', 'of Agree'),
(1673, 'Agree', 'v. i.', 'To harmonize in opinion, statement, or action; to be in\n   unison or concord; to be or become united or consistent; to concur; as,\n   all parties agree in the expediency of the law.'),
(1674, 'Agree', 'v. i.', 'To yield assent; to accede; -- followed by to; as, to\n   agree to an offer, or to opinion.'),
(1675, 'Agree', 'v. i.', 'To make a stipulation by way of settling differences or\n   determining a price; to exchange promises; to come to terms or to a\n   common resolve; to promise.'),
(1676, 'Agree', 'v. i.', 'To be conformable; to resemble; to coincide; to\n   correspond; as, the picture does not agree with the original; the two\n   scales agree exactly.'),
(1677, 'Agree', 'v. i.', 'To suit or be adapted in its effects; to do well; as, the\n   same food does not agree with every constitution.'),
(1678, 'Agree', 'v. i.', 'To correspond in gender, number, case, or person.'),
(1679, 'Agree', 'v. t.', 'To make harmonious; to reconcile or make friends.'),
(1680, 'Agree', 'v. t.', 'To admit, or come to one mind concerning; to settle; to\n   arrange; as, to agree the fact; to agree differences.'),
(1681, 'Agreer', 'n.', 'One who agrees.'),
(1682, 'Agrestic', 'a.', 'Pertaining to fields or the country, in opposition to the\n   city; rural; rustic; unpolished; uncouth.'),
(1683, 'Agrief', 'adv.', 'In grief; amiss.'),
(1684, 'Agrimony', 'n.', 'A genus of plants of the Rose family.'),
(1685, 'Agrimony', 'n.', 'The name is also given to various other plants; as, hemp\n   agrimony (Eupatorium cannabinum); water agrimony (Bidens).'),
(1686, 'Agrin', 'adv. & a.', 'In the act of grinning.'),
(1687, 'Agrise', 'v. i.', 'To shudder with terror; to tremble with fear.'),
(1688, 'Agrise', 'v. t.', 'To shudder at; to abhor; to dread; to loathe.'),
(1689, 'Agrise', 'v. t.', 'To terrify; to affright.'),
(1690, 'Agrom', 'n.', 'A disease occurring in Bengal and other parts of the East\n   Indies, in which the tongue chaps and cleaves.'),
(1691, 'Agronomy', 'n.', 'The management of land; rural economy; agriculture.'),
(1692, 'Agrope', 'adv. & a.', 'In the act of groping.'),
(1693, 'Agrostis', 'n.', 'A genus of grasses, including species called in common\n   language bent grass. Some of them, as redtop (Agrostis vulgaris), are\n   valuable pasture grasses.'),
(1694, 'Aground', 'adv. & a.', 'On the ground; stranded; -- a nautical term applied\n   to a ship when its bottom lodges on the ground.'),
(1695, 'Agued', 'imp. & p. p.', 'of Ague'),
(1696, 'Aguilt', 'v. t.', 'To be guilty of; to offend; to sin against; to wrong.'),
(1697, 'Aguise', 'n.', 'Dress.'),
(1698, 'Aguise', 'v. t.', 'To dress; to attire; to adorn.'),
(1699, 'Aguish', 'a.', 'Having the qualities of an ague; somewhat cold or\n   shivering; chilly; shaky.'),
(1700, 'Aguish', 'a.', 'Productive of, or affected by, ague; as, the aguish\n   districts of England.'),
(1701, 'Agush', 'adv. & a.', 'In a gushing state.'),
(1702, 'Agynous', 'a.', 'Without female organs; male.'),
(1703, 'Ahead', 'adv.', 'In or to the front; in advance; onward.'),
(1704, 'Ahead', 'adv.', 'Headlong; without restraint.'),
(1705, 'Aheap', 'adv.', 'In a heap; huddled together.'),
(1706, 'Aheight', 'adv.', 'Aloft; on high.'),
(1707, 'Ahigh', 'adv.', 'On high.'),
(1708, 'Ahold', 'adv.', 'Near the wind; as, to lay a ship ahold.'),
(1709, 'Ahriman', 'n.', 'The Evil Principle or Being of the ancient Persians; the\n   Prince of Darkness as opposer to Ormuzd, the King of Light.'),
(1710, 'Ahull', 'adv.', 'With the sails furled, and the helm lashed alee; --\n   applied to ships in a storm. See Hull, n.'),
(1711, 'Aiblins', 'adv.', 'Alt. of Ablins'),
(1712, 'Ablins', 'adv.', 'Perhaps; possibly.'),
(1713, 'Aided', 'imp. & p. p.', 'of Aid'),
(1714, 'Aiding', 'p. pr. & vb. n.', 'of Aid'),
(1715, 'Aidance', 'n.', 'Aid.'),
(1716, 'Aidant', 'a.', 'Helping; helpful; supplying aid.'),
(1717, 'Aider', 'n.', 'One who, or that which, aids.'),
(1718, 'Aidful', 'a.', 'Helpful.'),
(1719, 'Aidless', 'a.', 'Helpless; without aid.'),
(1720, 'Aiglet', 'n.', 'Same as Aglet.'),
(1721, 'Aigre', 'a.', 'Sour.'),
(1722, 'Aigret', 'n.', 'Alt. of Aigrette'),
(1723, 'Aigrette', 'n.', 'The small white European heron. See Egret.'),
(1724, 'Aigrette', 'n.', 'A plume or tuft for the head composed of feathers, or of\n   gems, etc.'),
(1725, 'Aigrette', 'n.', 'A tuft like that of the egret.'),
(1726, 'Aigrette', 'n.', 'A feathery crown of seed; egret; as, the aigrette or down\n   of the dandelion or the thistle.'),
(1727, 'Aiguille', 'n.', 'A needle-shaped peak.'),
(1728, 'Aiguille', 'n.', 'An instrument for boring holes, used in blasting.'),
(1729, 'Aigulet', 'n.', 'See Aglet.'),
(1730, 'Ailed', 'imp. & p. p.', 'of Ail'),
(1731, 'Ailing', 'p. pr. & vb. n.', 'of Ail'),
(1732, 'Ailantus', 'n.', 'A genus of beautiful trees, natives of the East Indies.\n   The tree imperfectly di/cious, and the staminate or male plant is very\n   offensive when blossom.'),
(1733, 'Ailette', 'n.', 'A small square shield, formerly worn on the shoulders of\n   knights, -- being the prototype of the modern epaulet.'),
(1734, 'Ailment', 'n.', 'Indisposition; morbid affection of the body; -- not\n   applied ordinarily to acute diseases.'),
(1735, 'Aimed', 'imp. & p. p.', 'of Aim'),
(1736, 'Aiming', 'p. pr. & vb. n.', 'of Aim'),
(1737, 'Aimer', 'n.', 'One who aims, directs, or points.'),
(1738, 'Aimless', 'a.', 'Without aim or purpose; as, an aimless life.'),
(1739, 'Aired', 'imp. & p. p.', 'of Air'),
(1740, 'Airing', 'p. pr. & vb. n.', 'of Air'),
(1741, 'Air bed', '', 'A sack or matters inflated with air, and used as a bed.'),
(1742, 'Air cell', '', 'A cavity in the cellular tissue of plants, containing air\n   only.'),
(1743, 'Air cell', '', 'A receptacle of air in various parts of the system; as, a\n   cell or minute cavity in the walls of the air tubes of the lungs; the\n   air sac of birds; a dilatation of the air vessels in insects.'),
(1744, 'Air cock', '', 'A faucet to allow escape of air.'),
(1745, 'Airer', 'n.', 'One who exposes to the air.'),
(1746, 'Airer', 'n.', 'A frame on which clothes are aired or dried.'),
(1747, 'Air gas', '', 'See under Gas.'),
(1748, 'Air gun', '', 'A kind of gun in which the elastic force of condensed air is\n   used to discharge the ball. The air is powerfully compressed into a\n   reservoir attached to the gun, by a condensing pump, and is controlled\n   by a valve actuated by the trigger.'),
(1749, 'Air hole', '', 'A hole to admit or discharge air; specifically, a spot in\n   the ice not frozen over.'),
(1750, 'Air hole', '', 'A fault in a casting, produced by a bubble of air; a\n   blowhole.'),
(1751, 'Airily', 'adv.', 'In an airy manner; lightly; gaily; jauntily; flippantly.'),
(1752, 'Airiness', 'n.', 'The state or quality of being airy; openness or exposure\n   to the air; as, the airiness of a country seat.'),
(1753, 'Airiness', 'n.', 'Lightness of spirits; gayety; levity; as, the airiness of\n   young persons.'),
(1754, 'Airing', 'n.', 'A walk or a ride in the open air; a short excursion for\n   health\'s sake.'),
(1755, 'Airing', 'n.', 'An exposure to air, or to a fire, for warming, drying,\n   etc.; as, the airing of linen, or of a room.'),
(1756, 'Airless', 'a.', 'Not open to a free current of air; wanting fresh air, or\n   communication with the open air.'),
(1757, 'Airlike', 'a.', 'Resembling air.'),
(1758, 'Airling', 'n.', 'A thoughtless, gay person.'),
(1759, 'Air pipe', '', 'A pipe for the passage of air; esp. a ventilating pipe.'),
(1760, 'Air pump', '', 'A kind of pump for exhausting air from a vessel or closed\n   space; also, a pump to condense air or force it into a closed space.'),
(1761, 'Air pump', '', 'A pump used to exhaust from a condenser the condensed\n   steam, the water used for condensing, and any commingled air.'),
(1762, 'Air sac', '', 'One of the spaces in different parts of the bodies of birds,\n   which are filled with air and connected with the air passages of the\n   lungs; an air cell.'),
(1763, 'Airward', 'adv.', 'Alt. of Airwards'),
(1764, 'Airwards', 'adv.', 'Toward the air; upward.'),
(1765, 'Aisle', 'n.', 'A lateral division of a building, separated from the middle\n   part, called the nave, by a row of columns or piers, which support the\n   roof or an upper wall containing windows, called the clearstory wall.'),
(1766, 'Aisle', 'n.', 'Improperly used also for the have; -- as in the phrases, a\n   church with three aisles, the middle aisle.'),
(1767, 'Aisle', 'n.', 'Also (perhaps from confusion with alley), a passage into\n   which the pews of a church open.'),
(1768, 'Aisled', 'a.', 'Furnished with an aisle or aisles.'),
(1769, 'Aisless', 'a.', 'Without an aisle.'),
(1770, 'Aitch', 'n.', 'The letter h or H.'),
(1771, 'Ajutage', 'n.', 'A tube through which water is discharged; an efflux tube;\n   as, the ajutage of a fountain.'),
(1772, 'Akene', 'n.', 'Same as Achene.'),
(1773, 'Aketon', 'n.', 'See Acton.'),
(1774, 'Akimbo', 'a.', 'With a crook or bend; with the hand on the hip and elbow\n   turned outward.'),
(1775, 'Akinesia', 'n.', 'Paralysis of the motor nerves; loss of movement.'),
(1776, 'Akinesic', 'a.', 'Pertaining to akinesia.'),
(1777, 'Aknee', 'adv.', 'On the knee.'),
(1778, 'Aknow', '', 'Earlier form of Acknow.'),
(1779, 'Alack', 'interj.', 'An exclamation expressive of sorrow.'),
(1780, 'Alacrify', 'v. t.', 'To rouse to action; to inspirit.'),
(1781, 'Alacrity', 'n.', 'A cheerful readiness, willingness, or promptitude; joyous\n   activity; briskness; sprightliness; as, the soldiers advanced with\n   alacrity to meet the enemy.'),
(1782, 'Alalonga', 'n.', 'Alt. of Alilonghi'),
(1783, 'Alamire', 'n.', 'The lowest note but one in Guido Aretino\'s scale of music.'),
(1784, 'Alamode', 'adv. & a.', 'According to the fashion or prevailing mode.'),
(1785, 'Alamode', 'n.', 'A thin, black silk for hoods, scarfs, etc.; -- often\n   called simply mode.'),
(1786, 'Alamort', 'a.', 'To the death; mortally.'),
(1787, 'Aland', 'adv.', 'On land; to the land; ashore.'),
(1788, 'Alanine', 'n.', 'A white crystalline base, C3H7NO2, derived from aldehyde\n   ammonia.'),
(1789, 'Alantin', 'n.', 'See Inulin.'),
(1790, 'Alarm', 'n.', 'A summons to arms, as on the approach of an enemy.'),
(1791, 'Alarm', 'n.', 'Any sound or information intended to give notice of\n   approaching danger; a warning sound to arouse attention; a warning of\n   danger.'),
(1792, 'Alarm', 'n.', 'A sudden attack; disturbance; broil.'),
(1793, 'Alarm', 'n.', 'Sudden surprise with fear or terror excited by apprehension\n   of danger; in the military use, commonly, sudden apprehension of being\n   attacked by surprise.'),
(1794, 'Alarm', 'n.', 'A mechanical contrivance for awaking persons from sleep, or\n   rousing their attention; an alarum.'),
(1795, 'Alarmed', 'imp. & p. p.', 'of Alarm'),
(1796, 'Alarming', 'p. pr. & vb. n.', 'of Alarm'),
(1797, 'Alarm', 'v. t.', 'To call to arms for defense; to give notice to (any one)\n   of approaching danger; to rouse to vigilance and action; to put on the\n   alert.'),
(1798, 'Alarm', 'v. t.', 'To keep in excitement; to disturb.'),
(1799, 'Alarm', 'v. t.', 'To surprise with apprehension of danger; to fill with\n   anxiety in regard to threatening evil; to excite with sudden fear.'),
(1800, 'Alarmed', 'a.', 'Aroused to vigilance; excited by fear of approaching\n   danger; agitated; disturbed; as, an alarmed neighborhood; an alarmed\n   modesty.'),
(1801, 'Alarming', 'a.', 'Exciting, or calculated to excite, alarm; causing\n   apprehension of danger; as, an alarming crisis or report. --\n   A*larm\"ing*ly, adv.'),
(1802, 'Alarmist', 'n.', 'One prone to sound or excite alarms, especially, needless\n   alarms.'),
(1803, 'Alarum', 'n.', 'See Alarm.'),
(1804, 'Alary', 'a.', 'Of or pertaining to wings; also, wing-shaped.'),
(1805, 'Alate', 'adv.', 'Lately; of late.'),
(1806, 'Alate', 'a.', 'Alt. of Alated'),
(1807, 'Alated', 'a.', 'Winged; having wings, or side appendages like wings.'),
(1808, 'Alatern', 'n.', 'Alt. of Alaternus'),
(1809, 'Alation', 'n.', 'The state of being winged.'),
(1810, 'Alaunt', 'n.', 'See Alan.'),
(1811, 'Albacore', 'n.', 'See Albicore.'),
(1812, 'Alban', 'n.', 'A white crystalline resinous substance extracted from\n   gutta-percha by the action of alcohol or ether.'),
(1813, 'Albanian', 'a.', 'Of or pertaining to Albania, a province of Turkey.'),
(1814, 'Albanian', 'n.', 'A native of Albania.'),
(1815, 'Albata', 'n.', 'A white metallic alloy; which is made into spoons, forks,\n   teapots, etc. British plate or German silver. See German silver, under\n   German.'),
(1816, 'Albee', 'conj.', 'Although; albeit.'),
(1817, 'Albedo', 'n.', 'Whiteness. Specifically: (Astron.) The ratio which the\n   light reflected from an unpolished surface bears to the total light\n   falling upon that surface.'),
(1818, 'Albeit', 'conj.', 'Even though; although; notwithstanding.'),
(1819, 'Albicant', 'a.', 'Growing or becoming white.'),
(1820, 'Albicore', 'n.', 'A name applied to several large fishes of the Mackerel\n   family, esp. Orcynus alalonga. One species (Orcynus thynnus), common in\n   the Mediterranean and Atlantic, is called in New England the horse\n   mackerel; the tunny.'),
(1821, 'Albiness', 'n.', 'A female albino.'),
(1822, 'Albinism', 'n.', 'The state or condition of being an albino: abinoism;\n   leucopathy.'),
(1823, 'Albinos', 'pl. ', 'of Albino'),
(1824, 'Albino', 'n.', 'A person, whether negro, Indian, or white, in whom by some\n   defect of organization the substance which gives color to the skin,\n   hair, and eyes is deficient or in a morbid state. An albino has a skin\n   of a milky hue, with hair of the same color, and eyes with deep red\n   pupil and pink or blue iris. The term is also used of the lower\n   animals, as white mice, elephants, etc.; and of plants in a whitish\n   condition from the absence of chlorophyll.'),
(1825, 'Albion', 'n.', 'An ancient name of England, still retained in poetry.'),
(1826, 'Albite', 'n.', 'A mineral of the feldspar family, triclinic in\n   crystallization, and in composition a silicate of alumina and soda. It\n   is a common constituent of granite and of various igneous rocks. See\n   Feldspar.'),
(1827, 'Albolith', 'n.', 'A kind of plastic cement, or artificial stone, consisting\n   chiefly of magnesia and silica; -- called also albolite.'),
(1828, 'Alborak', 'n.', 'The imaginary milk-white animal on which Mohammed was said\n   to have been carried up to heaven; a white mule.'),
(1829, 'Albugo', 'n.', 'Same as Leucoma.'),
(1830, 'Album', 'n.', 'A white tablet on which anything was inscribed, as a list of\n   names, etc.'),
(1831, 'Album', 'n.', 'A register for visitors\' names; a visitors\' book.'),
(1832, 'Album', 'n.', 'A blank book, in which to insert autographs sketches,\n   memorial writing of friends, photographs, etc.'),
(1833, 'Albumen', 'n.', 'The white of an egg.'),
(1834, 'Albumen', 'n.', 'Nourishing matter stored up within the integuments of the\n   seed in many plants, but not incorporated in the embryo. It is the\n   floury part in corn, wheat, and like grains, the oily part in poppy\n   seeds, the fleshy part in the cocoanut, etc.'),
(1835, 'Albumen', 'n.', 'Same as Albumin.'),
(1836, 'Albumin', 'n.', 'A thick, viscous nitrogenous substance, which is the chief\n   and characteristic constituent of white of eggs and of the serum of\n   blood, and is found in other animal substances, both fluid and solid,\n   also in many plants. It is soluble in water and is coagulated by heat\n   and by certain chemical reagents.'),
(1837, 'Albumose', 'n.', 'A compound or class of compounds formed from albumin by\n   dilute acids or by an acid solution of pepsin. Used also in\n   combination, as antialbumose, hemialbumose.'),
(1838, 'Alburn', 'n.', 'The bleak, a small European fish having scales of a\n   peculiarly silvery color which are used in making artificial pearls.'),
(1839, 'Alburnum', 'n.', 'The white and softer part of wood, between the inner bark\n   and the hard wood or duramen; sapwood.'),
(1840, 'Albyn', 'n.', 'Scotland; esp. the Highlands of Scotland.'),
(1841, 'Alcade', 'n.', 'Same as Alcaid.'),
(1842, 'Alcahest', 'n.', 'Same as Alkahest.'),
(1843, 'Alcaic', 'a.', 'Pertaining to Alcaeus, a lyric poet of Mitylene, about 6000\n   b. c.'),
(1844, 'Alcaic', 'n.', 'A kind of verse, so called from Alcaeus. One variety\n   consists of five feet, a spondee or iambic, an iambic, a long syllable,\n   and two dactyls.'),
(1845, 'Alcaid', 'n.', 'Alt. of Alcayde'),
(1846, 'Alcayde', 'n.', 'A commander of a castle or fortress among the Spaniards,\n   Portuguese, and Moors.'),
(1847, 'Alcayde', 'n.', 'The warden, or keeper of a jail.'),
(1848, 'Alcalde', 'n.', 'A magistrate or judge in Spain and in Spanish America,\n   etc.'),
(1849, 'Alcanna', 'n.', 'An oriental shrub (Lawsonia inermis) from which henna is\n   obtained.'),
(1850, 'Alcayde', 'n.', 'Same as Alcaid.'),
(1851, 'Alcazar', 'n.', 'A fortress; also, a royal palace.'),
(1852, 'Alcedo', 'n.', 'A genus of perching birds, including the European\n   kingfisher (Alcedo ispida). See Halcyon.'),
(1853, 'Alchemic', 'a.', 'Alt. of Alchemical'),
(1854, 'Alchemy', 'n.', 'An imaginary art which aimed to transmute the baser metals\n   into gold, to find the panacea, or universal remedy for diseases, etc.\n   It led the way to modern chemistry.'),
(1855, 'Alchemy', 'n.', 'A mixed metal composed mainly of brass, formerly used for\n   various utensils; hence, a trumpet.'),
(1856, 'Alchemy', 'n.', 'Miraculous power of transmuting something common into\n   something precious.'),
(1857, 'Alchymic', 'n.', 'Alt. of Alchymy'),
(1858, 'Alchymy', 'n.', 'See Alchemic, Alchemist, Alchemistic, Alchemy.'),
(1859, 'Alcoate', 'n.', 'Alt. of Alcohate'),
(1860, 'Alcohate', 'n.', 'Shortened forms of Alcoholate.'),
(1861, 'Alcohol', 'n.', 'An impalpable powder.'),
(1862, 'Alcohol', 'n.', 'The fluid essence or pure spirit obtained by distillation.'),
(1863, 'Alcohol', 'n.', 'Pure spirit of wine; pure or highly rectified spirit\n   (called also ethyl alcohol); the spirituous or intoxicating element of\n   fermented or distilled liquors, or more loosely a liquid containing it\n   in considerable quantity. It is extracted by simple distillation from\n   various vegetable juices and infusions of a saccharine nature, which\n   have undergone vinous fermentation.'),
(1864, 'Alcohol', 'n.', 'A class of compounds analogous to vinic alcohol in\n   constitution. Chemically speaking, they are hydroxides of certain\n   organic radicals; as, the radical ethyl forms common or ethyl alcohol\n   (C2H5.OH); methyl forms methyl alcohol (CH3.OH) or wood spirit; amyl\n   forms amyl alcohol (C5H11.OH) or fusel oil, etc.'),
(1865, 'Alcoran', 'n.', 'The Mohammedan Scriptures; the Koran (now the usual form).'),
(1866, 'Alcove', 'n.', 'A recessed portion of a room, or a small room opening into\n   a larger one; especially, a recess to contain a bed; a lateral recess\n   in a library.'),
(1867, 'Alcove', 'n.', 'A small ornamental building with seats, or an arched seat,\n   in a pleasure ground; a garden bower.'),
(1868, 'Alcove', 'n.', 'Any natural recess analogous to an alcove or recess in an\n   apartment.'),
(1869, 'Alcyon', 'n.', 'See Halcyon.'),
(1870, 'Alcyones', 'n. pl.', 'The kingfishers.'),
(1871, 'Alcyonic', 'a.', 'Of or pertaining to the Alcyonaria.'),
(1872, 'Alday', 'adv.', 'Continually.'),
(1873, 'Aldehyde', 'n.', 'A colorless, mobile, and very volatile liquid obtained\n   from alcohol by certain processes of oxidation.'),
(1874, 'Alder', 'n.', 'A tree, usually growing in moist land, and belonging to the\n   genus Alnus. The wood is used by turners, etc.; the bark by dyers and\n   tanners. In the U. S. the species of alder are usually shrubs or small\n   trees.'),
(1875, 'Alder', 'a.', 'Alt. of Aller'),
(1876, 'Aller', 'a.', 'Of all; -- used in composition; as, alderbest, best of all,\n   alderwisest, wisest of all.'),
(1877, 'Aldermen', 'pl. ', 'of Alderman'),
(1878, 'Alderman', 'n.', 'A senior or superior; a person of rank or dignity.'),
(1879, 'Alderman', 'n.', 'One of a board or body of municipal officers next in\n   order to the mayor and having a legislative function. They may, in some\n   cases, individually exercise some magisterial and administrative\n   functions.'),
(1880, 'Aldern', 'a.', 'Made of alder.'),
(1881, 'Alderney', 'n.', 'One of a breed of cattle raised in Alderney, one of the\n   Channel Islands. Alderneys are of a dun or tawny color and are often\n   called Jersey cattle. See Jersey, 3.'),
(1882, 'Aldine', 'a.', 'An epithet applied to editions (chiefly of the classics)\n   which proceeded from the press of Aldus Manitius, and his family, of\n   Venice, for the most part in the 16th century and known by the sign of\n   the anchor and the dolphin. The term has also been applied to certain\n   elegant editions of English works.'),
(1883, 'Aleak', 'adv. & a.', 'In a leaking condition.'),
(1884, 'Aleatory', 'a.', 'Depending on some uncertain contingency; as, an aleatory\n   contract.'),
(1885, 'Alebench', 'n.', 'A bench in or before an alehouse.'),
(1886, 'Aleberry', 'n.', 'A beverage, formerly made by boiling ale with spice,\n   sugar, and sops of bread.'),
(1887, 'Alecost', 'n.', 'The plant costmary, which was formerly much used for\n   flavoring ale.'),
(1888, 'Alegar', 'n.', 'Sour ale; vinegar made of ale.'),
(1889, 'Aleger', 'a.', 'Gay; cheerful; sprightly.'),
(1890, 'Alegge', 'v. t.', 'To allay or alleviate; to lighten.'),
(1891, 'Alehoof', 'n.', 'Ground ivy (Nepeta Glechoma).'),
(1892, 'Alehouse', 'n.', 'A house where ale is retailed; hence, a tippling house.'),
(1893, 'Alembic', 'n.', 'An apparatus formerly used in distillation, usually made\n   of glass or metal. It has mostly given place to the retort and worm\n   still.'),
(1894, 'Alength', 'adv.', 'At full length; lengthwise.'),
(1895, 'Alepole', 'n.', 'A pole set up as the sign of an alehouse.'),
(1896, 'Alert', 'a.', 'Watchful; vigilant; active in vigilance.'),
(1897, 'Alert', 'a.', 'Brisk; nimble; moving with celerity.'),
(1898, 'Alert', 'n.', 'An alarm from a real or threatened attack; a sudden attack;\n   also, a bugle sound to give warning.'),
(1899, 'Alertly', 'adv.', 'In an alert manner; nimbly.'),
(1900, 'Alestake', 'n.', 'A stake or pole projecting from, or set up before, an\n   alehouse, as a sign; an alepole. At the end was commonly suspended a\n   garland, a bunch of leaves, or a \"bush.\"'),
(1901, 'Aleurone', 'n.', 'An albuminoid substance which occurs in minute grains\n   (\"protein granules\") in maturing seeds and tubers; -- supposed to be a\n   modification of protoplasm.'),
(1902, 'Aleutian', 'a.', 'Alt. of Aleutic'),
(1903, 'Aleutic', 'a.', 'Of or pertaining to a chain of islands between Alaska and\n   Kamtchatka; also, designating these islands.'),
(1904, 'Alevin', 'n.', 'Young fish; fry.'),
(1905, 'Alewives', 'pl. ', 'of Alewife'),
(1906, 'Alewife', 'n.', 'A woman who keeps an alehouse.'),
(1907, 'Alewives', 'pl. ', 'of Alewife'),
(1908, 'Alewife', 'n.', 'A North American fish (Clupea vernalis) of the Herring\n   family. It is called also ellwife, ellwhop, branch herring. The name is\n   locally applied to other related species.'),
(1909, 'Alfalfa', 'n.', 'The lucern (Medicago sativa); -- so called in California,\n   Texas, etc.'),
(1910, 'Alfenide', 'n.', 'An alloy of nickel and silver electroplated with silver.'),
(1911, 'Alferes', 'n.', 'An ensign; a standard bearer.'),
(1912, 'Alfet', 'n.', 'A caldron of boiling water into which an accused person\n   plunged his forearm as a test of innocence or guilt.'),
(1913, 'Alfione', 'n.', 'An edible marine fish of California (Rhacochilus toxotes).'),
(1914, 'Alfresco', 'adv. & a.', 'In the open-air.'),
(1915, 'Algae', 'pl. ', 'of Alga'),
(1916, 'Algal', 'a.', 'Pertaining to, or like, algae.'),
(1917, 'Algaroba', 'n.', 'The Carob, a leguminous tree of the Mediterranean region;\n   also, its edible beans or pods, called St. John\'s bread.'),
(1918, 'Algaroba', 'n.', 'The Honey mesquite (Prosopis juliflora), a small tree\n   found from California to Buenos Ayres; also, its sweet, pulpy pods. A\n   valuable gum, resembling gum arabic, is collected from the tree in\n   Texas and Mexico.'),
(1919, 'Algarot', 'n.', 'Alt. of Algaroth'),
(1920, 'Algaroth', 'n.', 'A term used for the Powder of Algaroth, a white powder\n   which is a compound of trichloride and trioxide of antimony. It was\n   formerly used in medicine as an emetic, purgative, and diaphoretic.'),
(1921, 'Algate', 'adv.', 'Alt. of Algates'),
(1922, 'Algates', 'adv.', 'Always; wholly; everywhere.'),
(1923, 'Algates', 'adv.', 'By any or means; at all events.'),
(1924, 'Algates', 'adv.', 'Notwithstanding; yet.'),
(1925, 'Algazel', 'n.', 'The true gazelle.'),
(1926, 'Algebra', 'n.', 'That branch of mathematics which treats of the relations\n   and properties of quantity by means of letters and other symbols. It is\n   applicable to those relations that are true of every kind of magnitude.'),
(1927, 'Algebra', 'n.', 'A treatise on this science.'),
(1928, 'Algerian', 'a.', 'Of or pertaining to Algeria.'),
(1929, 'Algerian', 'n.', 'A native of Algeria.'),
(1930, 'Algerine', 'a.', 'Of or pertaining to Algiers or Algeria.'),
(1931, 'Algerine', 'n.', 'A native or one of the people of Algiers or Algeria.\n   Also, a pirate.'),
(1932, 'Algid', 'a.', 'Cold; chilly.'),
(1933, 'Algidity', 'n.', 'Chilliness; coldness'),
(1934, 'Algidity', 'n.', 'coldness and collapse.'),
(1935, 'Algific', 'a.', 'Producing cold.'),
(1936, 'Algoid', 'a.', 'Of the nature of, or resembling, an alga.'),
(1937, 'Algol', 'n.', 'A fixed star, in Medusa\'s head, in the constellation\n   Perseus, remarkable for its periodic variation in brightness.'),
(1938, 'Algology', 'n.', 'The study or science of algae or seaweeds.'),
(1939, 'Algonkin', 'n.', 'One of a widely spread family of Indians, including many\n   distinct tribes, which formerly occupied most of the northern and\n   eastern part of North America. The name was originally applied to a\n   group of Indian tribes north of the River St. Lawrence.'),
(1940, 'Algor', 'n.', 'Cold; chilliness.'),
(1941, 'Algorism', 'n.', 'Alt. of Algorithm'),
(1942, 'Algous', 'a.', 'Of or pertaining to the algae, or seaweeds; abounding with,\n   or like, seaweed.'),
(1943, 'Alguazil', 'n.', 'An inferior officer of justice in Spain; a warrant\n   officer; a constable.'),
(1944, 'Algum', 'n.', 'Same as Almug (and etymologically preferable).'),
(1945, 'Alhambra', 'n.', 'The palace of the Moorish kings at Granada.'),
(1946, 'Alhenna', 'n.', 'See Henna.'),
(1947, 'Alias', 'adv.', 'Otherwise; otherwise called; -- a term used in legal\n   proceedings to connect the different names of any one who has gone by\n   two or more, and whose true name is for any cause doubtful; as, Smith,\n   alias Simpson.'),
(1948, 'Alias', 'adv.', 'At another time.'),
(1949, 'Aliases', 'pl. ', 'of Alias'),
(1950, 'Alias', 'n.', 'A second or further writ which is issued after a first writ\n   has expired without effect.'),
(1951, 'Alias', 'n.', 'Another name; an assumed name.'),
(1952, 'Alibi', 'n.', 'The plea or mode of defense under which a person on trial\n   for a crime proves or attempts to prove that he was in another place\n   when the alleged act was committed; as, to set up an alibi; to prove an\n   alibi.'),
(1953, 'Alible', 'a.', 'Nutritive; nourishing.'),
(1954, 'Alicant', 'n.', 'A kind of wine, formerly much esteemed; -- said to have\n   been made near Alicant, in Spain.'),
(1955, 'Alidade', 'n.', 'The portion of a graduated instrument, as a quadrant or\n   astrolabe, carrying the sights or telescope, and showing the degrees\n   cut off on the arc of the instrument'),
(1956, 'Alien', 'a.', 'Not belonging to the same country, land, or government, or\n   to the citizens or subjects thereof; foreign; as, alien subjects,\n   enemies, property, shores.'),
(1957, 'Alien', 'a.', 'Wholly different in nature; foreign; adverse; inconsistent\n   (with); incongruous; -- followed by from or sometimes by to; as,\n   principles alien from our religion.'),
(1958, 'Alien', 'n.', 'A foreigner; one owing allegiance, or belonging, to another\n   country; a foreign-born resident of a country in which he does not\n   possess the privileges of a citizen. Hence, a stranger. See Alienage.'),
(1959, 'Alien', 'n.', 'One excluded from certain privileges; one alienated or\n   estranged; as, aliens from God\'s mercies.'),
(1960, 'Alien', 'v. t.', 'To alienate; to estrange; to transfer, as property or\n   ownership.'),
(1961, 'Alienage', 'n.', 'The state or legal condition of being an alien.'),
(1962, 'Alienage', 'n.', 'The state of being alienated or transferred to another.'),
(1963, 'Alienate', 'a.', 'Estranged; withdrawn in affection; foreign; -- with from.'),
(1964, 'Alienate', 'v. t.', 'To convey or transfer to another, as title, property,\n   or right; to part voluntarily with ownership of.'),
(1965, 'Alienate', 'v. t.', 'To withdraw, as the affections; to make indifferent of\n   averse, where love or friendship before subsisted; to estrange; to\n   wean; -- with from.'),
(1966, 'Alienate', 'n.', 'A stranger; an alien.'),
(1967, 'Aliene', 'v. t.', 'To alien or alienate; to transfer, as title or property;\n   as, to aliene an estate.'),
(1968, 'Alienee', 'n.', 'One to whom the title of property is transferred; --\n   opposed to alienor.'),
(1969, 'Alienism', 'n.', 'The status or legal condition of an alien; alienage.'),
(1970, 'Alienism', 'n.', 'The study or treatment of diseases of the mind.'),
(1971, 'Alienist', 'n.', 'One who treats diseases of the mind.'),
(1972, 'Alienor', 'n.', 'One who alienates or transfers property to another.'),
(1973, 'Alife', 'adv.', 'On my life; dearly.'),
(1974, 'Aliform', 'a.', 'Wing-shaped; winglike.'),
(1975, 'Alighted', 'imp. & p. p.', 'of Alight'),
(1976, 'Alight', 'v. i.', 'To spring down, get down, or descend, as from on\n   horseback or from a carriage; to dismount.'),
(1977, 'Alight', 'v. i.', 'To descend and settle, lodge, rest, or stop; as, a\n   flying bird alights on a tree; snow alights on a roof.'),
(1978, 'Alight', 'v. i.', 'To come or chance (upon).'),
(1979, 'Alight', 'a.', 'Lighted; lighted up; in a flame.'),
(1980, 'Align', 'v. t.', 'To adjust or form to a line; to range or form in line; to\n   bring into line; to aline.'),
(1981, 'Align', 'v. t.', 'To form in line; to fall into line.'),
(1982, 'Alike', 'a.', 'Having resemblance or similitude; similar; without\n   difference.'),
(1983, 'Alike', 'adv.', 'In the same manner, form, or degree; in common; equally;\n   as, we are all alike concerned in religion.'),
(1984, 'Aliment', 'n.', 'That which nourishes; food; nutriment; anything which\n   feeds or adds to a substance in natural growth. Hence: The necessaries\n   of life generally: sustenance; means of support.'),
(1985, 'Aliment', 'n.', 'An allowance for maintenance.'),
(1986, 'Aliment', 'v. t.', 'To nourish; to support.'),
(1987, 'Aliment', 'v. t.', 'To provide for the maintenance of.'),
(1988, 'Alimony', 'n.', 'Maintenance; means of living.'),
(1989, 'Alimony', 'n.', 'An allowance made to a wife out of her husband\'s estate or\n   income for her support, upon her divorce or legal separation from him,\n   or during a suit for the same.'),
(1990, 'Alinasal', 'a.', 'Pertaining to expansions of the nasal bone or cartilage.'),
(1991, 'Aline', 'v. t.', 'To range or place in a line; to bring into line; to\n   align.'),
(1992, 'Aliner', 'n.', 'One who adjusts things to a line or lines or brings them\n   into line.'),
(1993, 'Alioth', 'n.', 'A star in the tail of the Great Bear, the one next the bowl\n   in the Dipper.'),
(1994, 'Aliped', 'a.', 'Wing-footed, as the bat.'),
(1995, 'Aliped', 'n.', 'An animal whose toes are connected by a membrane, serving\n   for a wing, as the bat.'),
(1996, 'Aliquant', 'a.', 'An aliquant part of a number or quantity is one which\n   does not divide it without leaving a remainder; thus, 5 is an aliquant\n   part of 16. Opposed to aliquot.'),
(1997, 'Aliquot', 'a.', 'An aliquot part of a number or quantity is one which will\n   divide it without a remainder; thus, 5 is an aliquot part of 15.\n   Opposed to aliquant.'),
(1998, 'Alish', 'a.', 'Like ale; as, an alish taste.'),
(1999, 'Alitrunk', 'n.', 'The segment of the body of an insect to which the wings\n   are attached; the thorax.'),
(2000, 'Aliunde', 'adv. & a.', 'From another source; from elsewhere; as, a case\n   proved aliunde; evidence aliunde.'),
(2001, 'Alive', 'a.', 'Having life, in opposition to dead; living; being in a state\n   in which the organs perform their functions; as, an animal or a plant\n   which is alive.'),
(2002, 'Alive', 'a.', 'In a state of action; in force or operation; unextinguished;\n   unexpired; existent; as, to keep the fire alive; to keep the affections\n   alive.'),
(2003, 'Alive', 'a.', 'Exhibiting the activity and motion of many living beings;\n   swarming; thronged.'),
(2004, 'Alive', 'a.', 'Sprightly; lively; brisk.'),
(2005, 'Alive', 'a.', 'Having susceptibility; easily impressed; having lively\n   feelings, as opposed to apathy; sensitive.'),
(2006, 'Alive', 'a.', 'Of all living (by way of emphasis).'),
(2007, 'Alizari', 'n.', 'The madder of the Levant.'),
(2008, 'Alizarin', 'n.', 'A coloring principle, C14H6O2(OH)2, found in madder, and\n   now produced artificially from anthracene. It produces the Turkish\n   reds.'),
(2009, 'Alkahest', 'n.', 'The fabled \"universal solvent\" of the alchemists; a\n   menstruum capable of dissolving all bodies.'),
(2010, 'Alkalis', 'pl. ', 'of Alkali'),
(2011, 'Alkalies', 'pl. ', 'of Alkali'),
(2012, 'Alkali', 'n.', 'Soda ash; caustic soda, caustic potash, etc.'),
(2013, 'Alkali', 'n.', 'One of a class of caustic bases, such as soda, potash,\n   ammonia, and lithia, whose distinguishing peculiarities are solubility\n   in alcohol and water, uniting with oils and fats to form soap,\n   neutralizing and forming salts with acids, turning to brown several\n   vegetable yellows, and changing reddened litmus to blue.'),
(2014, 'Alkalify', 'v. t.', 'To convert into an alkali; to give alkaline properties\n   to.'),
(2015, 'Alkalify', 'v. i.', 'To become changed into an alkali.'),
(2016, 'Alkaline', 'a.', 'Of or pertaining to an alkali or to alkalies; having the\n   properties of an alkali.'),
(2017, 'Alkalize', 'v. t.', 'To render alkaline; to communicate the properties of\n   an alkali to.'),
(2018, 'Alkaloid', 'a.', 'Alt. of Alkaloidal'),
(2019, 'Alkaloid', 'n.', 'An organic base, especially one of a class of substances\n   occurring ready formed in the tissues of plants and the bodies of\n   animals.'),
(2020, 'Alkanet', 'n.', 'A dyeing matter extracted from the roots of Alkanna\n   tinctoria, which gives a fine deep red color.'),
(2021, 'Alkanet', 'n.', 'A boraginaceous herb (Alkanna tinctoria) yielding the dye;\n   orchanet.'),
(2022, 'Alkanet', 'n.', 'The similar plant Anchusa officinalis; bugloss; also, the\n   American puccoon.'),
(2023, 'Alkargen', 'n.', 'Same as Cacodylic acid.'),
(2024, 'Alkarsin', 'n.', 'A spontaneously inflammable liquid, having a repulsive\n   odor, and consisting of cacodyl and its oxidation products; -- called\n   also Cadel\'s fuming liquid.'),
(2025, 'Alkazar', '', 'See Alcazar.'),
(2026, 'Alkermes', 'n.', 'A compound cordial, in the form of a confection, deriving\n   its name from the kermes insect, its principal ingredient.'),
(2027, 'Alkoran', 'n.', 'The Mohammedan Scriptures. Same as Alcoran and Koran.'),
(2028, 'Allah', 'n.', 'The name of the Supreme Being, in use among the Arabs and\n   the Mohammedans generally.'),
(2029, 'Allanite', 'n.', 'A silicate containing a large amount of cerium. It is\n   usually black in color, opaque, and is related to epidote in form and\n   composition.'),
(2030, 'Allayed', 'imp. & p. p.', 'of Allay'),
(2031, 'Allaying', 'p. pr. & vb. n.', 'of Allay'),
(2032, 'Allay', 'v. t.', 'To make quiet or put at rest; to pacify or appease; to\n   quell; to calm; as, to allay popular excitement; to allay the tumult of\n   the passions.'),
(2033, 'Allay', 'v. t.', 'To alleviate; to abate; to mitigate; as, to allay the\n   severity of affliction or the bitterness of adversity.'),
(2034, 'Allay', 'v. t.', 'To diminish in strength; to abate; to subside.'),
(2035, 'Allay', 'n.', 'Alleviation; abatement; check.'),
(2036, 'Allay', 'n.', 'Alloy.'),
(2037, 'Allay', 'v. t.', 'To mix (metals); to mix with a baser metal; to alloy; to\n   deteriorate.'),
(2038, 'Allayer', 'n.', 'One who, or that which, allays.'),
(2039, 'Allecret', 'n.', 'A kind of light armor used in the sixteenth century, esp.\n   by the Swiss.'),
(2040, 'Allect', 'v. t.', 'To allure; to entice.'),
(2041, 'Alledge', 'v. t.', 'See Allege.'),
(2042, 'Alleged', 'imp. & p. p.', 'of Allege'),
(2043, 'Alleging', 'p. pr. & vb. n.', 'of Allege'),
(2044, 'Allege', 'v. t.', 'To bring forward with positiveness; to declare; to\n   affirm; to assert; as, to allege a fact.'),
(2045, 'Allege', 'v. t.', 'To cite or quote; as, to allege the authority of a\n   judge.'),
(2046, 'Allege', 'v. t.', 'To produce or urge as a reason, plea, or excuse; as, he\n   refused to lend, alleging a resolution against lending.'),
(2047, 'Allege', 'v. t.', 'To alleviate; to lighten, as a burden or a trouble.'),
(2048, 'Alleger', 'n.', 'One who affirms or declares.'),
(2049, 'Allegge', 'v. t.', 'See Alegge and Allay.'),
(2050, 'Allegory', 'n.', 'A figurative sentence or discourse, in which the\n   principal subject is described by another subject resembling it in its\n   properties and circumstances. The real subject is thus kept out of\n   view, and we are left to collect the intentions of the writer or\n   speaker by the resemblance of the secondary to the primary subject.'),
(2051, 'Allegory', 'n.', 'Anything which represents by suggestive resemblance; an\n   emblem.'),
(2052, 'Allegory', 'n.', 'A figure representation which has a meaning beyond notion\n   directly conveyed by the object painted or sculptured.'),
(2053, 'Allegro', 'a.', 'Brisk, lively.'),
(2054, 'Allegro', 'n.', 'An allegro movement; a quick, sprightly strain or piece.'),
(2055, 'Alleluia', 'n.', 'Alt. of Alleluiah'),
(2056, 'Aller', 'a.', 'Same as Alder, of all.'),
(2057, 'Allerion', 'n.', 'Am eagle without beak or feet, with expanded wings.'),
(2058, 'Alleys', 'pl. ', 'of Alley'),
(2059, 'Alley', 'n.', 'A narrow passage; especially a walk or passage in a garden\n   or park, bordered by rows of trees or bushes; a bordered way.'),
(2060, 'Alley', 'n.', 'A narrow passage or way in a city, as distinct from a public\n   street.'),
(2061, 'Alley', 'n.', 'A passageway between rows of pews in a church.'),
(2062, 'Alley', 'n.', 'Any passage having the entrance represented as wider than\n   the exit, so as to give the appearance of length.'),
(2063, 'Alley', 'n.', 'The space between two rows of compositors\' stands in a\n   printing office.'),
(2064, 'Alleys', 'pl. ', 'of Alley'),
(2065, 'Alley', 'n.', 'A choice taw or marble.'),
(2066, 'Alleyed', 'a.', 'Furnished with alleys; forming an alley.'),
(2067, 'Alleyway', 'n.', 'An alley.'),
(2068, 'Allfours', '', 'A game at cards, called \"High, Low, Jack, and the Game.\"'),
(2069, 'All hail', 'interj.', 'All health; -- a phrase of salutation or welcome.'),
(2070, 'All-hail', 'v. t.', 'To salute; to greet.'),
(2071, 'Allheal', 'n.', 'A name popularly given to the officinal valerian, and to\n   some other plants.'),
(2072, 'Alliable', 'a.', 'Able to enter into alliance.'),
(2073, 'Alliance', 'n.', 'The state of being allied; the act of allying or uniting;\n   a union or connection of interests between families, states, parties,\n   etc., especially between families by marriage and states by compact,\n   treaty, or league; as, matrimonial alliances; an alliance between\n   church and state; an alliance between France and England.'),
(2074, 'Alliance', 'n.', 'Any union resembling that of families or states; union by\n   relationship in qualities; affinity.'),
(2075, 'Alliance', 'n.', 'The persons or parties allied.'),
(2076, 'Alliance', 'v. t.', 'To connect by alliance; to ally.'),
(2077, 'Alliant', 'n.', 'An ally; a confederate.'),
(2078, 'Allice', 'n.', 'Alt. of Allis'),
(2079, 'Allis', 'n.', 'The European shad (Clupea vulgaris); allice shad. See Alose.'),
(2080, 'Allied', 'a.', 'United; joined; leagued; akin; related. See Ally.'),
(2081, 'Alligate', 'v. t.', 'To tie; to unite by some tie.'),
(2082, 'Allision', 'n.', 'The act of dashing against, or striking upon.'),
(2083, 'Allium', 'n.', 'A genus of plants, including the onion, garlic, leek,\n   chive, etc.'),
(2084, 'Allmouth', 'n.', 'The angler.'),
(2085, 'Allness', 'n.', 'Totality; completeness.'),
(2086, 'Allnight', 'n.', 'Light, fuel, or food for the whole night.'),
(2087, 'Allocate', 'v. t.', 'To distribute or assign; to allot.'),
(2088, 'Allocate', 'v. t.', 'To localize.'),
(2089, 'Allod', 'n.', 'See Allodium.'),
(2090, 'Allodial', 'a.', 'Pertaining to allodium; freehold; free of rent or\n   service; held independent of a lord paramount; -- opposed to feudal;\n   as, allodial lands; allodial system.'),
(2091, 'Allodial', 'a.', 'Anything held allodially.'),
(2092, 'Allodium', 'n.', 'Freehold estate; land which is the absolute property of\n   the owner; real estate held in absolute independence, without being\n   subject to any rent, service, or acknowledgment to a superior. It is\n   thus opposed to feud.'),
(2093, 'Allogamy', 'n.', 'Fertilization of the pistil of a plant by pollen from\n   another of the same species; cross-fertilization.'),
(2094, 'Allonge', 'v.', 'A thrust or pass; a lunge.'),
(2095, 'Allonge', 'v.', 'A slip of paper attached to a bill of exchange for\n   receiving indorsements, when the back of the bill itself is already\n   full; a rider.'),
(2096, 'Allonge', 'v. i.', 'To thrust with a sword; to lunge.'),
(2097, 'Allonym', 'n.', 'The name of another person assumed by the author of a\n   work.'),
(2098, 'Allonym', 'n.', 'A work published under the name of some one other than the\n   author.'),
(2099, 'Alloo', 'v. t. / i.', 'To incite dogs by a call; to halloo.'),
(2100, 'Allopath', 'n.', 'An allopathist.'),
(2101, 'Alloquy', 'n.', 'A speaking to another; an address.'),
(2102, 'Allotted', 'imp. & p. p.', 'of Allot'),
(2103, 'Allot', 'v. t.', 'To distribute by lot.'),
(2104, 'Allot', 'v. t.', 'To distribute, or parcel out in parts or portions; or to\n   distribute to each individual concerned; to assign as a share or lot;\n   to set apart as one\'s share; to bestow on; to grant; to appoint; as,\n   let every man be contented with that which Providence allots him.'),
(2105, 'Allottee', 'n.', 'One to whom anything is allotted; one to whom an\n   allotment is made.'),
(2106, 'Allotter', 'n.', 'One who allots.'),
(2107, 'Allowed', 'imp. & p. p.', 'of Allow'),
(2108, 'Allowing', 'p. pr. & vb. n.', 'of Allow'),
(2109, 'Allow', 'v. t.', 'To praise; to approve of; hence, to sanction.'),
(2110, 'Allow', 'v. t.', 'To like; to be suited or pleased with.'),
(2111, 'Allow', 'v. t.', 'To sanction; to invest; to intrust.'),
(2112, 'Allow', 'v. t.', 'To grant, give, admit, accord, afford, or yield; to let\n   one have; as, to allow a servant his liberty; to allow a free passage;\n   to allow one day for rest.'),
(2113, 'Allow', 'v. t.', 'To own or acknowledge; to accept as true; to concede; to\n   accede to an opinion; as, to allow a right; to allow a claim; to allow\n   the truth of a proposition.'),
(2114, 'Allow', 'v. t.', 'To grant (something) as a deduction or an addition; esp.\n   to abate or deduct; as, to allow a sum for leakage.'),
(2115, 'Allow', 'v. t.', 'To grant license to; to permit; to consent to; as, to\n   allow a son to be absent.'),
(2116, 'Allow', 'v. i.', 'To admit; to concede; to make allowance or abatement.'),
(2117, 'Allower', 'n.', 'An approver or abettor.'),
(2118, 'Allower', 'n.', 'One who allows or permits.'),
(2119, 'Alloxan', 'n.', 'An oxidation product of uric acid. It is of a pale reddish\n   color, readily soluble in water or alcohol.'),
(2120, 'Alloy', 'v. t.', 'Any combination or compound of metals fused together; a\n   mixture of metals; for example, brass, which is an alloy of copper and\n   zinc. But when mercury is one of the metals, the compound is called an\n   amalgam.'),
(2121, 'Alloy', 'v. t.', 'The quality, or comparative purity, of gold or silver;\n   fineness.'),
(2122, 'Alloy', 'v. t.', 'A baser metal mixed with a finer.'),
(2123, 'Alloy', 'v. t.', 'Admixture of anything which lessens the value or detracts\n   from; as, no happiness is without alloy.'),
(2124, 'Alloyed', 'imp. & p. p.', 'of Alloy'),
(2125, 'Alloying', 'p. pr. & vb. n.', 'of Alloy'),
(2126, 'Alloy', 'v. t.', 'To reduce the purity of by mixing with a less valuable\n   substance; as, to alloy gold with silver or copper, or silver with\n   copper.'),
(2127, 'Alloy', 'v. t.', 'To mix, as metals, so as to form a compound.'),
(2128, 'Alloy', 'v. t.', 'To abate, impair, or debase by mixture; to allay; as, to\n   alloy pleasure with misfortunes.'),
(2129, 'Alloy', 'v. t.', 'To form a metallic compound.'),
(2130, 'Alloyage', 'n.', 'The act or art of alloying metals; also, the combination\n   or alloy.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(2131, 'Allspice', 'n.', 'The berry of the pimento (Eugenia pimenta), a tree of the\n   West Indies; a spice of a mildly pungent taste, and agreeably aromatic;\n   Jamaica pepper; pimento. It has been supposed to combine the flavor of\n   cinnamon, nutmegs, and cloves; and hence the name. The name is also\n   given to other aromatic shrubs; as, the Carolina allspice (Calycanthus\n   floridus); wild allspice (Lindera benzoin), called also spicebush,\n   spicewood, and feverbush.'),
(2132, 'Allthing', 'adv.', 'Altogether.'),
(2133, 'Alluded', 'imp. & p. p.', 'of Allude'),
(2134, 'Alluding', 'p. pr. & vb. n.', 'of Allude'),
(2135, 'Allude', 'v. i.', 'To refer to something indirectly or by suggestion; to\n   have reference to a subject not specifically and plainly mentioned; --\n   followed by to; as, the story alludes to a recent transaction.'),
(2136, 'Allude', 'v. t.', 'To compare allusively; to refer (something) as\n   applicable.'),
(2137, 'Alluded', 'imp. & p. p.', 'of Allure'),
(2138, 'Alluring', 'p. pr. & vb. n.', 'of Allure'),
(2139, 'Allure', 'v. t.', 'To attempt to draw; to tempt by a lure or bait, that is,\n   by the offer of some good, real or apparent; to invite by something\n   flattering or acceptable; to entice; to attract.'),
(2140, 'Allure', 'n.', 'Allurement.'),
(2141, 'Allure', 'n.', 'Gait; bearing.'),
(2142, 'Allurer', 'n.', 'One who, or that which, allures.'),
(2143, 'Alluring', 'a.', 'That allures; attracting; charming; tempting.'),
(2144, 'Allusion', 'n.', 'A figurative or symbolical reference.'),
(2145, 'Allusion', 'n.', 'A reference to something supposed to be known, but not\n   explicitly mentioned; a covert indication; indirect reference; a hint.'),
(2146, 'Allusive', 'a.', 'Figurative; symbolical.'),
(2147, 'Allusive', 'a.', 'Having reference to something not fully expressed;\n   containing an allusion.'),
(2148, 'Allusory', 'a.', 'Allusive.'),
(2149, 'Alluvial', 'a.', 'Pertaining to, contained in, or composed of, alluvium;\n   relating to the deposits made by flowing water; washed away from one\n   place and deposited in another; as, alluvial soil, mud, accumulations,\n   deposits.'),
(2150, 'Alluvion', 'n.', 'Wash or flow of water against the shore or bank.'),
(2151, 'Alluvion', 'n.', 'An overflowing; an inundation; a flood.'),
(2152, 'Alluvion', 'n.', 'Matter deposited by an inundation or the action of\n   flowing water; alluvium.'),
(2153, 'Alluvion', 'n.', 'An accession of land gradually washed to the shore or\n   bank by the flowing of water. See Accretion.'),
(2154, 'Alluvia', 'pl. ', 'of Alluvium'),
(2155, 'Alluvium', 'n.', 'Deposits of earth, sand, gravel, and other transported\n   matter, made by rivers, floods, or other causes, upon land not\n   permanently submerged beneath the waters of lakes or seas.'),
(2156, 'Allwhere', 'adv.', 'Everywhere.'),
(2157, 'Allwork', 'n.', 'Domestic or other work of all kinds; as, a maid of\n   allwork, that is, a general servant.'),
(2158, 'Allied', 'imp. & p. p.', 'of Ally'),
(2159, 'Allying', 'p. pr. & vb. n.', 'of Ally'),
(2160, 'Allies', 'pl. ', 'of Ally'),
(2161, 'Allyl', 'n.', 'An organic radical, C3H5, existing especially in oils of\n   garlic and mustard.'),
(2162, 'Allylene', 'n.', 'A gaseous hydrocarbon, C3H4, homologous with acetylene;\n   propine.'),
(2163, 'Almah', 'n.', 'Same as Alme.'),
(2164, 'Almadia', 'n.', 'Alt. of Almadie'),
(2165, 'Almadie', 'n.', 'A bark canoe used by the Africans.'),
(2166, 'Almadie', 'n.', 'A boat used at Calicut, in India, about eighty feet long,\n   and six or seven broad.'),
(2167, 'Almagest', 'n.', 'The celebrated work of Ptolemy of Alexandria, which\n   contains nearly all that is known of the astronomical observations and\n   theories of the ancients. The name was extended to other similar works.'),
(2168, 'Almagra', 'n.', 'A fine, deep red ocher, somewhat purplish, found in Spain.\n   It is the sil atticum of the ancients. Under the name of Indian red it\n   is used for polishing glass and silver.'),
(2169, 'Almain', 'n.', 'Alt. of Alman'),
(2170, 'Almayne', 'n.', 'Alt. of Alman'),
(2171, 'Alman', 'n.', 'A German.'),
(2172, 'Alman', 'adj.', 'German.'),
(2173, 'Alman', 'adj.', 'The German language.'),
(2174, 'Alman', 'adj.', 'A kind of dance. See Allemande.'),
(2175, 'Almanac', 'n.', 'A book or table, containing a calendar of days, and\n   months, to which astronomical data and various statistics are often\n   added, such as the times of the rising and setting of the sun and moon,\n   eclipses, hours of full tide, stated festivals of churches, terms of\n   courts, etc.'),
(2176, 'Almeh', 'n.', 'An Egyptian dancing girl; an Alma.'),
(2177, 'Almery', 'n.', 'See Ambry.'),
