(2429, 'Amenable', 'a.', 'Liable to punishment, a charge, a claim, etc.'),
(2430, 'Amenable', 'a.', 'Willing to yield or submit; responsive; tractable.'),
(2431, 'Amenably', 'adv.', 'In an amenable manner.'),
(2432, 'Amenage', 'v. t.', 'To manage.'),
(2433, 'Amenance', 'n.', 'Behavior; bearing.'),
(2434, 'Amended', 'imp. & p. p.', 'of Amend'),
(2435, 'Amending', 'p. pr. & vb. n.', 'of Amend'),
(2436, 'Amend', 'v. t.', 'To change or modify in any way for the better'),
(2437, 'Amend', 'v. t.', 'by simply removing what is erroneous, corrupt,\n   superfluous, faulty, and the like;'),
(2438, 'Amend', 'v. t.', 'by supplying deficiencies;'),
(2439, 'Amend', 'v. t.', 'by substituting something else in the place of what is\n   removed; to rectify.'),
(2440, 'Amend', 'v. i.', 'To grow better by rectifying something wrong in manners\n   or morals; to improve.'),
(2441, 'Amende', 'n.', 'A pecuniary punishment or fine; a reparation or\n   recantation.'),
(2442, 'Amender', 'n.', 'One who amends.'),
(2443, 'Amendful', 'a.', 'Much improving.'),
(2444, 'Amends', 'n. sing. & pl.', 'Compensation for a loss or injury; recompense;\n   reparation.'),
(2445, 'Amenity', 'n.', 'The quality of being pleasant or agreeable, whether in\n   respect to situation, climate, manners, or disposition; pleasantness;\n   civility; suavity; gentleness.'),
(2446, 'Ament', 'n.', 'A species of inflorescence; a catkin.'),
(2447, 'Amentia', 'n.', 'Imbecility; total want of understanding.'),
(2448, 'Amenta', 'pl. ', 'of Amentum'),
(2449, 'Amentum', 'n.', 'Same as Ament.'),
(2450, 'Amenuse', 'v. t.', 'To lessen.'),
(2451, 'Amerced', 'imp. & p. p.', 'of Amerce'),
(2452, 'Amercing', 'p. pr. & vb. n.', 'of Amerce'),
(2453, 'Amerce', 'v. t.', 'To punish by a pecuniary penalty, the amount of which is\n   not fixed by law, but left to the discretion of the court; as, the\n   amerced the criminal in the sum on the hundred dollars.'),
(2454, 'Amerce', 'v. t.', 'To punish, in general; to mulct.'),
(2455, 'Amercer', 'n.', 'One who amerces.'),
(2456, 'American', 'a.', 'Of or pertaining to America; as, the American continent:\n   American Indians.'),
(2457, 'American', 'a.', 'Of or pertaining to the United States.'),
(2458, 'American', 'n.', 'A native of America; -- originally applied to the\n   aboriginal inhabitants, but now applied to the descendants of Europeans\n   born in America, and especially to the citizens of the United States.'),
(2459, 'Ames-ace', 'n.', 'Same as Ambs-ace.'),
(2460, 'Amess', 'n.', 'Amice, a hood or cape. See 2d Amice.'),
(2461, 'Amethyst', '', 'A variety of crystallized quartz, of a purple or bluish\n   violet color, of different shades. It is much used as a jeweler\'s\n   stone.'),
(2462, 'Amethyst', '', 'A purple color in a nobleman\'s escutcheon, or coat of arms.'),
(2463, 'Amharic', 'a.', 'Of or pertaining to Amhara, a division of Abyssinia; as,\n   the Amharic language is closely allied to the Ethiopic.'),
(2464, 'Amharic', 'n.', 'The Amharic language (now the chief language of\n   Abyssinia).'),
(2465, 'Amiable', 'a.', 'Lovable; lovely; pleasing.'),
(2466, 'Amiable', 'a.', 'Friendly; kindly; sweet; gracious; as, an amiable temper\n   or mood; amiable ideas.'),
(2467, 'Amiable', 'a.', 'Possessing sweetness of disposition; having sweetness of\n   temper, kind-heartedness, etc., which causes one to be liked; as, an\n   amiable woman.'),
(2468, 'Amiable', 'a.', 'Done out of love.'),
(2469, 'Amiably', 'adv.', 'In an amiable manner.'),
(2470, 'Amianth', 'n.', 'See Amianthus.'),
(2471, 'Amicable', 'a.', 'Friendly; proceeding from, or exhibiting, friendliness;\n   after the manner of friends; peaceable; as, an amicable disposition, or\n   arrangement.'),
(2472, 'Amicably', 'adv.', 'In an amicable manner.'),
(2473, 'Amice', 'n.', 'A square of white linen worn at first on the head, but now\n   about the neck and shoulders, by priests of the Roman Catholic Church\n   while saying Mass.'),
(2474, 'Amice', 'n.', 'A hood, or cape with a hood, made of lined with gray fur,\n   formerly worn by the clergy; -- written also amess, amyss, and almuce.'),
(2475, 'Amide', 'n.', 'A compound formed by the union of amidogen with an acid\n   element or radical. It may also be regarded as ammonia in which one or\n   more hydrogen atoms have been replaced by an acid atom or radical.'),
(2476, 'Amidin', 'n.', 'Start modified by heat so as to become a transparent mass,\n   like horn. It is soluble in cold water.'),
(2477, 'Amido', 'a.', 'Containing, or derived from, amidogen.'),
(2478, 'Amidogen', 'n.', 'A compound radical, NH2, not yet obtained in a separate\n   state, which may be regarded as ammonia from the molecule of which one\n   of its hydrogen atoms has been removed; -- called also the amido group,\n   and in composition represented by the form amido.'),
(2479, 'Amidst', 'prep.', 'Alt. of Amid'),
(2480, 'Amine', 'n.', 'One of a class of strongly basic substances derived from\n   ammonia by replacement of one or more hydrogen atoms by a basic atom or\n   radical.'),
(2481, 'Amioid', 'a.', 'Like or pertaining to the Amioidei.'),
(2482, 'Amioid', 'n.', 'One of the Amioidei.'),
(2483, 'Amioidei', 'n. pl.', 'An order of ganoid fishes of which Amia is the type.\n   See Bowfin and Ganoidei.'),
(2484, 'Amiss', 'adv.', 'Astray; faultily; improperly; wrongly; ill.'),
(2485, 'Amiss', 'a.', 'Wrong; faulty; out of order; improper; as, it may not be\n   amiss to ask advice.'),
(2486, 'Amiss', 'n.', 'A fault, wrong, or mistake.'),
(2487, 'Amission', 'n.', 'Deprivation; loss.'),
(2488, 'Amities', 'pl. ', 'of Amity'),
(2489, 'Amity', 'n.', 'Friendship, in a general sense, between individuals,\n   societies, or nations; friendly relations; good understanding; as, a\n   treaty of amity and commerce; the amity of the Whigs and Tories.'),
(2490, 'Ammeter', 'n.', 'A contraction of amperometer or amperemeter.'),
(2491, 'Ammiral', 'n.', 'An obsolete form of admiral.'),
(2492, 'Ammite', 'n.', 'Oolite or roestone; -- written also hammite.'),
(2493, 'Ammodyte', 'n.', 'One of a genus of fishes; the sand eel.'),
(2494, 'Ammodyte', 'n.', 'A kind of viper in southern Europe.'),
(2495, 'Ammonia', 'n.', 'A gaseous compound of hydrogen and nitrogen, NH3, with a\n   pungent smell and taste: -- often called volatile alkali, and spirits\n   of hartshorn.'),
(2496, 'Ammoniac', 'a.', 'Alt. of Ammoniacal'),
(2497, 'Ammoniac', 'n.', 'Alt. of Gum ammoniac'),
(2498, 'Ammonic', 'a.', 'Of or pertaining to ammonia.'),
(2499, 'Ammonite', 'n.', 'A fossil cephalopod shell related to the nautilus. There\n   are many genera and species, and all are extinct, the typical forms\n   having existed only in the Mesozoic age, when they were exceedingly\n   numerous. They differ from the nautili in having the margins of the\n   septa very much lobed or plaited, and the siphuncle dorsal. Also called\n   serpent stone, snake stone, and cornu Ammonis.'),
(2500, 'Ammonium', 'n.', 'A compound radical, NH4, having the chemical relations of\n   a strongly basic element like the alkali metals.'),
(2501, 'Amnesia', 'n.', 'Forgetfulness; also, a defect of speech, from cerebral\n   disease, in which the patient substitutes wrong words or names in the\n   place of those he wishes to employ.'),
(2502, 'Amnesic', 'a.', 'Of or pertaining to amnesia.'),
(2503, 'Amnestic', 'a.', 'Causing loss of memory.'),
(2504, 'Amnesty', 'v.', 'Forgetfulness; cessation of remembrance of wrong;\n   oblivion.'),
(2505, 'Amnesty', 'v.', 'An act of the sovereign power granting oblivion, or a\n   general pardon, for a past offense, as to subjects concerned in an\n   insurrection.'),
(2506, 'Amnesty', 'v. t.', 'To grant amnesty to.'),
(2507, 'Amnion', 'n.', 'A thin membrane surrounding the embryos of mammals, birds,\n   and reptiles.'),
(2508, 'Amnios', 'n.', 'Same as Amnion.'),
(2509, 'Amniota', 'n. pl.', 'That group of vertebrates which develops in its\n   embryonic life the envelope called the amnion. It comprises the\n   reptiles, the birds, and the mammals.'),
(2510, 'Amniotic', 'a.', 'Of or pertaining to the amnion; characterized by an\n   amnion; as, the amniotic fluid; the amniotic sac.'),
(2511, 'Amoebae', 'pl. ', 'of Amoeba'),
(2512, 'Amoebas', 'pl. ', 'of Amoeba'),
(2513, 'Amoeba', 'n.', 'A rhizopod. common in fresh water, capable of undergoing\n   many changes of form at will. See Rhizopoda.'),
(2514, 'Amoebea', 'n. pl.', 'That division of the Rhizopoda which includes the\n   amoeba and similar forms.'),
(2515, 'Amoebean', 'a.', 'Alternately answering.'),
(2516, 'Amoebian', 'n.', 'One of the Amoebea.'),
(2517, 'Amoeboid', 'a.', 'Resembling an amoeba; amoeba-shaped; changing in shape\n   like an amoeba.'),
(2518, 'Amoebous', 'a.', 'Like an amoeba in structure.'),
(2519, 'Amomum', 'n.', 'A genus of aromatic plants. It includes species which bear\n   cardamoms, and grains of paradise.'),
(2520, 'Amoneste', 'v. t.', 'To admonish.'),
(2521, 'Among', 'prep.', 'Alt. of Amongst'),
(2522, 'Amongst', 'prep.', 'Mixed or mingled; surrounded by.'),
(2523, 'Amongst', 'prep.', 'Conjoined, or associated with, or making part of the\n   number of; in the number or class of.'),
(2524, 'Amongst', 'prep.', 'Expressing a relation of dispersion, distribution,\n   etc.; also, a relation of reciprocal action.'),
(2525, 'Amoret', 'n.', 'An amorous girl or woman; a wanton.'),
(2526, 'Amoret', 'n.', 'A love knot, love token, or love song. (pl.) Love glances\n   or love tricks.'),
(2527, 'Amoret', 'n.', 'A petty love affair or amour.'),
(2528, 'Amorette', 'n.', 'An amoret.'),
(2529, 'Amorist', 'n.', 'A lover; a gallant.'),
(2530, 'Amorosa', 'n.', 'A wanton woman; a courtesan.'),
(2531, 'Amoroso', 'n.', 'A lover; a man enamored.'),
(2532, 'Amoroso', 'adv.', 'In a soft, tender, amatory style.'),
(2533, 'Amorous', 'a.', 'Inclined to love; having a propensity to love, or to\n   sexual enjoyment; loving; fond; affectionate; as, an amorous\n   disposition.'),
(2534, 'Amorous', 'a.', 'Affected with love; in love; enamored; -- usually with of;\n   formerly with on.'),
(2535, 'Amorous', 'a.', 'Of or relating to, or produced by, love.'),
(2536, 'Amorphas', 'pl. ', 'of Amorpha'),
(2537, 'Amorpha', 'n.', 'A genus of leguminous shrubs, having long clusters of\n   purple flowers; false or bastard indigo.'),
(2538, 'Amorphy', 'n.', 'Shapelessness.'),
(2539, 'Amort', 'a.', 'As if dead; lifeless; spiritless; dejected; depressed.'),
(2540, 'Amortise', 'n.', 'Alt. of Amortisement'),
(2541, 'Amortize', 'v. t.', 'To make as if dead; to destroy.'),
(2542, 'Amortize', 'v. t.', 'To alienate in mortmain, that is, to convey to a\n   corporation. See Mortmain.'),
(2543, 'Amortize', 'v. t.', 'To clear off or extinguish, as a debt, usually by\n   means of a sinking fund.'),
(2544, 'Amorwe', 'adv.', 'In the morning.'),
(2545, 'Amorwe', 'adv.', 'On the following morning.'),
(2546, 'Amotion', 'n.', 'Removal; ousting; especially, the removal of a corporate\n   officer from his office.'),
(2547, 'Amotion', 'n.', 'Deprivation of possession.'),
(2548, 'Amotus', 'a.', 'Elevated, -- as a toe, when raised so high that the tip\n   does not touch the ground.'),
(2549, 'Amounted', 'imp. & p. p.', 'of Amount'),
(2550, 'Amount', 'n.', 'To go up; to ascend.'),
(2551, 'Amount', 'n.', 'To rise or reach by an accumulation of particular sums or\n   quantities; to come (to) in the aggregate or whole; -- with to or unto.'),
(2552, 'Amount', 'n.', 'To rise, reach, or extend in effect, substance, or\n   influence; to be equivalent; to come practically (to); as, the\n   testimony amounts to very little.'),
(2553, 'Amount', 'v. t.', 'To signify; to amount to.'),
(2554, 'Amount', 'n.', 'The sum total of two or more sums or quantities; the\n   aggregate; the whole quantity; a totality; as, the amount of 7 and 9 is\n   16; the amount of a bill; the amount of this year\'s revenue.'),
(2555, 'Amount', 'n.', 'The effect, substance, value, significance, or result; the\n   sum; as, the amount of the testimony is this.'),
(2556, 'Amour', 'n.', 'Love; affection.'),
(2557, 'Amour', 'n.', 'Love making; a love affair; usually, an unlawful connection\n   in love; a love intrigue; an illicit love affair.'),
(2558, 'Amovable', 'a.', 'Removable.'),
(2559, 'Amove', 'v. t.', 'To remove, as a person or thing, from a position.'),
(2560, 'Amove', 'v. t.', 'To dismiss from an office or station.'),
(2561, 'Amove', 'v. t. & i.', 'To move or be moved; to excite.'),
(2562, 'Ampelite', 'n.', 'An earth abounding in pyrites, used by the ancients to\n   kill insects, etc., on vines; -- applied by Brongniart to a\n   carbonaceous alum schist.'),
(2563, 'Ampere', 'n.', 'Alt. of Ampere'),
(2564, 'Ampere', 'n.', 'The unit of electric current; -- defined by the\n   International Electrical Congress in 1893 and by U. S. Statute as, one\n   tenth of the unit of current of the C. G. S. system of electro-magnetic\n   units, or the practical equivalent of the unvarying current which, when\n   passed through a standard solution of nitrate of silver in water,\n   deposits silver at the rate of 0.001118 grams per second. Called also\n   the international ampere.'),
(2565, 'Amphi-', '', 'A prefix in words of Greek origin, signifying both, of both\n   kinds, on both sides, about, around.'),
(2566, 'Amphibia', 'n. pl.', 'One of the classes of vertebrates.'),
(2567, 'Amphibia', 'pl. ', 'of Amphibium'),
(2568, 'Amphid', 'n.', 'A salt of the class formed by the combination of an acid\n   and a base, or by the union of two oxides, two sulphides, selenides, or\n   tellurides, as distinguished from a haloid compound.'),
(2569, 'Amphigen', 'n.', 'An element that in combination produces amphid salt; --\n   applied by Berzelius to oxygen, sulphur, selenium, and tellurium.'),
(2570, 'Amphipod', 'n.', 'One of the Amphipoda.'),
(2571, 'Amphipod', 'a.', 'Alt. of Amphipodan'),
(2572, 'Amphiuma', 'n.', 'A genus of amphibians, inhabiting the Southern United\n   States, having a serpentlike form, but with four minute limbs and two\n   persistent gill openings; the Congo snake.'),
(2573, 'Amphora', 'n.', 'Among the ancients, a two-handled vessel, tapering at the\n   bottom, used for holding wine, oil, etc.'),
(2574, 'Amphoral', 'a.', 'Pertaining to, or resembling, an amphora.'),
(2575, 'Amphoric', 'a.', 'Produced by, or indicating, a cavity in the lungs, not\n   filled, and giving a sound like that produced by blowing into an empty\n   decanter; as, amphoric respiration or resonance.'),
(2576, 'Ample', 'a.', 'Large; great in size, extent, capacity, or bulk; spacious;\n   roomy; widely extended.'),
(2577, 'Ample', 'a.', 'Fully sufficient; abundant; liberal; copious; as, an ample\n   fortune; ample justice.'),
(2578, 'Ample', 'a.', 'Not contracted of brief; not concise; extended; diffusive;\n   as, an ample narrative.'),
(2579, 'Ampliate', 'v. t.', 'To enlarge.'),
(2580, 'Ampliate', 'a.', 'Having the outer edge prominent; said of the wings of\n   insects.'),
(2581, 'Amplify', 'v. t.', 'To render larger, more extended, or more intense, and\n   the like; -- used especially of telescopes, microscopes, etc.'),
(2582, 'Amplify', 'v. t.', 'To enlarge by addition or discussion; to treat\n   copiously by adding particulars, illustrations, etc.; to expand; to\n   make much of.'),
(2583, 'Amplify', 'v. i.', 'To become larger.'),
(2584, 'Amplify', 'v. i.', 'To speak largely or copiously; to be diffuse in\n   argument or description; to dilate; to expatiate; -- often with on or\n   upon.'),
(2585, 'Amply', 'adv.', 'In an ample manner.'),
(2586, 'Ampul', 'n.', 'Same as Ampulla, 2.'),
(2587, 'Ampullae', 'pl. ', 'of Ampulla'),
(2588, 'Ampulla', 'n.', 'A narrow-necked vessel having two handles and bellying out\n   like a jug.'),
(2589, 'Ampulla', 'n.', 'A cruet for the wine and water at Mass.'),
(2590, 'Ampulla', 'n.', 'The vase in which the holy oil for chrism, unction, or\n   coronation is kept.'),
(2591, 'Ampulla', 'n.', 'Any membranous bag shaped like a leathern bottle, as the\n   dilated end of a vessel or duct; especially the dilations of the\n   semicircular canals of the ear.'),
(2592, 'Ampullar', 'a.', 'Alt. of Ampullary'),
(2593, 'Amputate', 'v. t.', 'To prune or lop off, as branches or tendrils.'),
(2594, 'Amputate', 'v. t.', 'To cut off (a limb or projecting part of the body)'),
(2595, 'Ampyx', 'n.', 'A woman\'s headband (sometimes of metal), for binding the\n   front hair.'),
(2596, 'Amrita', 'n.', 'Immortality; also, the nectar conferring immortality.'),
(2597, 'Amrita', 'a.', 'Ambrosial; immortal.'),
(2598, 'Amsel', 'n.', 'Alt. of Amzel'),
(2599, 'Amzel', 'n.', 'The European ring ousel (Turdus torquatus).'),
(2600, 'Amuck', 'a. & adv.', 'In a frenzied and reckless manner.'),
(2601, 'Amulet', 'n.', 'An ornament, gem, or scroll, or a package containing a\n   relic, etc., worn as a charm or preservative against evils or mischief,\n   such as diseases and witchcraft, and generally inscribed with mystic\n   forms or characters. [Also used figuratively.]'),
(2602, 'Amuletic', 'a.', 'Of or pertaining to an amulet; operating as a charm.'),
(2603, 'Amurcous', 'a.', 'Full off dregs; foul.'),
(2604, 'Amusable', 'a.', 'Capable of being amused.'),
(2605, 'Amused', 'imp. & p. p.', 'of Amuse'),
(2606, 'Amusing', 'p. pr. & vb. n.', 'of Amuse'),
(2607, 'Amuse', 'v.', 'To occupy or engage the attention of; to lose in deep\n   thought; to absorb; also, to distract; to bewilder.'),
(2608, 'Amuse', 'v.', 'To entertain or occupy in a pleasant manner; to stir with\n   pleasing or mirthful emotions; to divert.'),
(2609, 'Amuse', 'v.', 'To keep in expectation; to beguile; to delude.'),
(2610, 'Amuse', 'v. i.', 'To muse; to mediate.'),
(2611, 'Amused', 'a.', 'Diverted.'),
(2612, 'Amused', 'a.', 'Expressing amusement; as, an amused look.'),
(2613, 'Amuser', 'n.', 'One who amuses.'),
(2614, 'Amusette', 'n.', 'A light field cannon, or stocked gun mounted on a swivel.'),
(2615, 'Amusing', 'a.', 'Giving amusement; diverting; as, an amusing story.'),
(2616, 'Amusive', 'a.', 'Having power to amuse or entertain the mind; fitted to\n   excite mirth.'),
(2617, 'Amyelous', 'a.', 'Wanting the spinal cord.'),
(2618, 'Amylate', 'n.', 'A compound of the radical amyl with oxygen and a positive\n   atom or radical.'),
(2619, 'Amylene', 'n.', 'One of a group of metameric hydrocarbons, C5H10, of the\n   ethylene series. The colorless, volatile, mobile liquid commonly called\n   amylene is a mixture of different members of the group.'),
(2620, 'Amylic', 'a.', 'Pertaining to, or derived from, amyl; as, amylic ether.'),
(2621, 'Amyloid', 'a.', 'Alt. of Amyloidal'),
(2622, 'Amyloid', 'n.', 'A non-nitrogenous starchy food; a starchlike substance.'),
(2623, 'Amyloid', 'n.', 'The substance deposited in the organs in amyloid\n   degeneration.'),
(2624, 'Amylose', 'n.', 'One of the starch group (C6H10O5)n of the carbohydrates;\n   as, starch, arabin, dextrin, cellulose, etc.'),
(2625, 'Amyous', 'a.', 'Wanting in muscle; without flesh.'),
(2626, 'Amyss', 'n.', 'Same as Amice, a hood or cape.'),
(2627, 'Anabas', 'n.', 'A genus of fishes, remarkable for their power of living\n   long out of water, and of making their way on land for considerable\n   distances, and for climbing trees; the climbing fishes.'),
(2628, 'Anabasis', 'n.', 'A journey or expedition up from the coast, like that of\n   the younger Cyrus into Central Asia, described by Xenophon in his work\n   called \"The Anabasis.\"'),
(2629, 'Anabasis', 'n.', 'The first period, or increase, of a disease;\n   augmentation.'),
(2630, 'Anabatic', 'a.', 'Pertaining to anabasis; as, an anabatic fever.'),
(2631, 'Anabolic', 'a.', 'Pertaining to anabolism; an anabolic changes, or\n   processes, more or less constructive in their nature.'),
(2632, 'Anaconda', 'n.', 'A large South American snake of the Boa family (Eunectes\n   murinus), which lives near rivers, and preys on birds and small\n   mammals. The name is also applied to a similar large serpent (Python\n   tigris) of Ceylon.'),
(2633, 'Anadem', 'n.', 'A garland or fillet; a chaplet or wreath.'),
(2634, 'Anadrom', 'n.', 'A fish that leaves the sea and ascends rivers.'),
(2635, 'Anaemia', 'a.', 'A morbid condition in which the blood is deficient in\n   quality or in quantity.'),
(2636, 'Anaemic', 'a.', 'Of or pertaining to anaemia.'),
(2637, 'Anaglyph', 'n.', 'Any sculptured, chased, or embossed ornament worked in\n   low relief, as a cameo.'),
(2638, 'Anagoge', 'n.', 'An elevation of mind to things celestial.'),
(2639, 'Anagoge', 'n.', 'The spiritual meaning or application; esp. the application\n   of the types and allegories of the Old Testament to subjects of the\n   New.'),
(2640, 'Anagogic', 'a.', 'Alt. of Anagogical'),
(2641, 'Anagogy', 'n.', 'Same as Anagoge.'),
(2642, 'Anagram', 'n.', 'Literally, the letters of a word read backwards, but in\n   its usual wider sense, the change or one word or phrase into another by\n   the transposition of its letters. Thus Galenus becomes angelus; William\n   Noy (attorney-general to Charles I., and a laborious man) may be turned\n   into I moyl in law.'),
(2643, 'Anagram', 'v. t.', 'To anagrammatize.'),
(2644, 'Anagraph', 'n.', 'An inventory; a record.'),
(2645, 'Anakim', 'n. pl.', 'Alt. of Anaks'),
(2646, 'Anaks', 'n. pl.', 'A race of giants living in Palestine.'),
(2647, 'Analcime', 'n.', 'A white or flesh-red mineral, of the zeolite family,\n   occurring in isometric crystals. By friction, it acquires a weak\n   electricity; hence its name.'),
(2648, 'Analcite', 'n.', 'Analcime.'),
(2649, 'Analects', 'n. pl.', 'Alt. of Analecta'),
(2650, 'Analecta', 'n. pl.', 'A collection of literary fragments.'),
(2651, 'Analemma', 'n.', 'An orthographic projection of the sphere on the plane of\n   the meridian, the eye being supposed at an infinite distance, and in\n   the east or west point of the horizon.'),
(2652, 'Analemma', 'n.', 'An instrument of wood or brass, on which this projection\n   of the sphere is made, having a movable horizon or cursor; -- formerly\n   much used in solving some common astronomical problems.'),
(2653, 'Analemma', 'n.', 'A scale of the sun\'s declination for each day of the\n   year, drawn across the torrid zone on an artificial terrestrial globe.'),
(2654, 'Analepsy', '', 'Recovery of strength after sickness.'),
(2655, 'Analepsy', '', 'A species of epileptic attack, originating from gastric\n   disorder.'),
(2656, 'Analogal', 'a.', 'Analogous.'),
(2657, 'Analogic', 'a.', 'Of or belonging to analogy.'),
(2658, 'Analogon', 'n.', 'Analogue.'),
(2659, 'Analogue', 'n.', 'That which is analogous to, or corresponds with, some\n   other thing.'),
(2660, 'Analogue', 'n.', 'A word in one language corresponding with one in another;\n   an analogous term; as, the Latin \"pater\" is the analogue of the English\n   \"father.\"'),
(2661, 'Analogue', 'n.', 'An organ which is equivalent in its functions to a\n   different organ in another species or group, or even in the same group;\n   as, the gill of a fish is the analogue of a lung in a quadruped,\n   although the two are not of like structural relations.'),
(2662, 'Analogue', 'n.', 'A species in one genus or group having its characters\n   parallel, one by one, with those of another group.'),
(2663, 'Analogue', 'n.', 'A species or genus in one country closely related to a\n   species of the same genus, or a genus of the same group, in another:\n   such species are often called representative species, and such genera,\n   representative genera.'),
(2664, 'Analogy', 'n.', 'A resemblance of relations; an agreement or likeness\n   between things in some circumstances or effects, when the things are\n   otherwise entirely different. Thus, learning enlightens the mind,\n   because it is to the mind what light is to the eye, enabling it to\n   discover things before hidden.'),
(2665, 'Analogy', 'n.', 'A relation or correspondence in function, between organs\n   or parts which are decidedly different.'),
(2666, 'Analogy', 'n.', 'Proportion; equality of ratios.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(2667, 'Analogy', 'n.', 'Conformity of words to the genius, structure, or general\n   rules of a language; similarity of origin, inflection, or principle of\n   pronunciation, and the like, as opposed to anomaly.'),
(2668, 'Analyse', 'n.', 'Alt. of Analyser'),
(2669, 'Analyser', 'n.', 'Same as Analyze, Analyzer, etc.'),
(2670, 'Analyses', 'pl. ', 'of Analysis'),
(2671, 'Analysis', 'n.', 'A resolution of anything, whether an object of the senses\n   or of the intellect, into its constituent or original elements; an\n   examination of the component parts of a subject, each separately, as\n   the words which compose a sentence, the tones of a tune, or the simple\n   propositions which enter into an argument. It is opposed to synthesis.'),
(2672, 'Analysis', 'n.', 'The separation of a compound substance, by chemical\n   processes, into its constituents, with a view to ascertain either (a)\n   what elements it contains, or (b) how much of each element is present.\n   The former is called qualitative, and the latter quantitative analysis.'),
(2673, 'Analysis', 'n.', 'The tracing of things to their source, and the resolving\n   of knowledge into its original principles.'),
(2674, 'Analysis', 'n.', 'The resolving of problems by reducing the conditions that\n   are in them to equations.'),
(2675, 'Analysis', 'n.', 'A syllabus, or table of the principal heads of a\n   discourse, disposed in their natural order.'),
(2676, 'Analysis', 'n.', 'A brief, methodical illustration of the principles of a\n   science. In this sense it is nearly synonymous with synopsis.'),
(2677, 'Analysis', 'n.', 'The process of ascertaining the name of a species, or its\n   place in a system of classification, by means of an analytical table or\n   key.'),
(2678, 'Analyst', 'n.', 'One who analyzes; formerly, one skilled in algebraical\n   geometry; now commonly, one skilled in chemical analysis.'),
(2679, 'Analytic', 'a.', 'Alt. of Analytical'),
(2680, 'Analyzed', 'imp. & p. p.', 'of Analyze'),
(2681, 'Analyze', 'v. t.', 'To subject to analysis; to resolve (anything complex)\n   into its elements; to separate into the constituent parts, for the\n   purpose of an examination of each separately; to examine in such a\n   manner as to ascertain the elements or nature of the thing examined;\n   as, to analyze a fossil substance; to analyze a sentence or a word; to\n   analyze an action to ascertain its morality.'),
(2682, 'Analyzer', 'n.', 'One who, or that which, analyzes.'),
(2683, 'Analyzer', 'n.', 'The part of a polariscope which receives the light after\n   polarization, and exhibits its properties.'),
(2684, 'Anamese', 'a.', 'Of or pertaining to Anam, to southeastern Asia.'),
(2685, 'Anamese', 'n.', 'A native of Anam.'),
(2686, 'Ananas', 'n.', 'The pineapple (Ananassa sativa).'),
(2687, 'Anapaest', '', 'Alt. of Anapaestic'),
(2688, 'Anapest', 'n.', 'A metrical foot consisting of three syllables, the first\n   two short, or unaccented, the last long, or accented (/ / -); the\n   reverse of the dactyl. In Latin d/-/-tas, and in English in-ter-vene#,\n   are examples of anapests.'),
(2689, 'Anapest', 'n.', 'A verse composed of such feet.'),
(2690, 'Anaphora', 'n.', 'A repetition of a word or of words at the beginning of\n   two or more successive clauses.'),
(2691, 'Anapnoic', 'a.', 'Relating to respiration.'),
(2692, 'Anarch', 'n.', 'The author of anarchy; one who excites revolt.'),
(2693, 'Anarchal', 'a.', 'Lawless; anarchical.'),
(2694, 'Anarchic', 'a.', 'Alt. of Anarchical'),
(2695, 'Anarchy', 'n.', 'Absence of government; the state of society where there is\n   no law or supreme power; a state of lawlessness; political confusion.'),
(2696, 'Anarchy', 'n.', 'Hence, confusion or disorder, in general.'),
(2697, 'Anasarca', 'n.', 'Dropsy of the subcutaneous cellular tissue; an effusion\n   of serum into the cellular substance, occasioning a soft, pale,\n   inelastic swelling of the skin.'),
(2698, 'Anastate', 'n.', 'One of a series of substances formed, in secreting cells,\n   by constructive or anabolic processes, in the production of protoplasm;\n   -- opposed to katastate.'),
(2699, 'Anathema', 'n.', 'A ban or curse pronounced with religious solemnity by\n   ecclesiastical authority, and accompanied by excommunication. Hence:\n   Denunciation of anything as accursed.'),
(2700, 'Anathema', 'n.', 'An imprecation; a curse; a malediction.'),
(2701, 'Anathema', 'n.', 'Any person or thing anathematized, or cursed by\n   ecclesiastical authority.'),
(2702, 'Anatifae', 'pl. ', 'of Anatifa'),
(2703, 'Anatifa', 'n.', 'An animal of the barnacle tribe, of the genus Lepas,\n   having a fleshy stem or peduncle; a goose barnacle. See Cirripedia.'),
(2704, 'Anatifer', 'n.', 'Same as Anatifa.'),
(2705, 'Anatine', 'a.', 'Of or pertaining to the ducks; ducklike.'),
(2706, 'Anatomic', 'a.', 'Alt. of Anatomical'),
(2707, 'Anatomy', 'n.', 'The art of dissecting, or artificially separating the\n   different parts of any organized body, to discover their situation,\n   structure, and economy; dissection.'),
(2708, 'Anatomy', 'n.', 'The science which treats of the structure of organic\n   bodies; anatomical structure or organization.'),
(2709, 'Anatomy', 'n.', 'A treatise or book on anatomy.'),
(2710, 'Anatomy', 'n.', 'The act of dividing anything, corporeal or intellectual,\n   for the purpose of examining its parts; analysis; as, the anatomy of a\n   discourse.'),
(2711, 'Anatomy', 'n.', 'A skeleton; anything anatomized or dissected, or which has\n   the appearance of being so.'),
(2712, 'Anatron', 'n.', 'Native carbonate of soda; natron.'),
(2713, 'Anatron', 'n.', 'Glass gall or sandiver.'),
(2714, 'Anatron', 'n.', 'Saltpeter.'),
(2715, 'Anatto', 'n.', 'Same as Annotto.'),
(2716, 'Anbury', 'n.', 'Alt. of Ambury'),
(2717, 'Ambury', 'n.', 'A soft tumor or bloody wart on horses or oxen.'),
(2718, 'Ambury', 'n.', 'A disease of the roots of turnips, etc.; -- called also\n   fingers and toes.'),
(2719, '-ance', '', 'A suffix signifying action; also, quality or state; as,\n   assistance, resistance, appearance, elegance. See -ancy.'),
(2720, 'Ancestor', 'n.', 'One from whom a person is descended, whether on the\n   father\'s or mother\'s side, at any distance of time; a progenitor; a\n   fore father.'),
(2721, 'Ancestor', 'n.', 'An earlier type; a progenitor; as, this fossil animal is\n   regarded as the ancestor of the horse.'),
(2722, 'Ancestor', 'n.', 'One from whom an estate has descended; -- the correlative\n   of heir.'),
(2723, 'Ancestry', 'n.', 'Condition as to ancestors; ancestral lineage; hence,\n   birth or honorable descent.'),
(2724, 'Ancestry', 'n.', 'A series of ancestors or progenitors; lineage, or those\n   who compose the line of natural descent.'),
(2725, 'Anchor', 'n.', 'A iron instrument which is attached to a ship by a cable\n   (rope or chain), and which, being cast overboard, lays hold of the\n   earth by a fluke or hook and thus retains the ship in a particular\n   station.'),
(2726, 'Anchor', 'n.', 'Any instrument or contrivance serving a purpose like that\n   of a ship\'s anchor, as an arrangement of timber to hold a dam fast; a\n   contrivance to hold the end of a bridge cable, or other similar part; a\n   contrivance used by founders to hold the core of a mold in place.'),
(2727, 'Anchor', 'n.', 'Fig.: That which gives stability or security; that on which\n   we place dependence for safety.'),
(2728, 'Anchor', 'n.', 'An emblem of hope.'),
(2729, 'Anchor', 'n.', 'A metal tie holding adjoining parts of a building together.'),
(2730, 'Anchor', 'n.', 'Carved work, somewhat resembling an anchor or arrowhead; --\n   a part of the ornaments of certain moldings. It is seen in the echinus,\n   or egg-and-anchor (called also egg-and-dart, egg-and-tongue) ornament.'),
(2731, 'Anchor', 'n.', 'One of the anchor-shaped spicules of certain sponges; also,\n   one of the calcareous spinules of certain Holothurians, as in species\n   of Synapta.'),
(2732, 'Anchored', 'imp. & p. p.', 'of Anchor'),
(2733, 'Anchor', 'v. t.', 'To place at anchor; to secure by an anchor; as, to\n   anchor a ship.'),
(2734, 'Anchor', 'v. t.', 'To fix or fasten; to fix in a stable condition; as, to\n   anchor the cables of a suspension bridge.'),
(2735, 'Anchor', 'v. i.', 'To cast anchor; to come to anchor; as, our ship (or the\n   captain) anchored in the stream.'),
(2736, 'Anchor', 'v. i.', 'To stop; to fix or rest.'),
(2737, 'Anchor', 'n.', 'An anchoret.'),
(2738, 'Anchored', 'a.', 'Held by an anchor; at anchor; held safely; as, an\n   anchored bark; also, shaped like an anchor; forked; as, an anchored\n   tongue.'),
(2739, 'Anchored', 'a.', 'Having the extremities turned back, like the flukes of an\n   anchor; as, an anchored cross.'),
(2740, 'Anchoret', 'n.', 'Alt. of Anchorite'),
(2741, 'Anchovy', 'n.', 'A small fish, about three inches in length, of the Herring\n   family (Engraulis encrasicholus), caught in vast numbers in the\n   Mediterranean, and pickled for exportation. The name is also applied to\n   several allied species.'),
(2742, 'Anchusin', 'n.', 'A resinoid coloring matter obtained from alkanet root.'),
(2743, 'Ancient', 'a.', 'Old; that happened or existed in former times, usually at\n   a great distance of time; belonging to times long past; specifically\n   applied to the times before the fall of the Roman empire; -- opposed to\n   modern; as, ancient authors, literature, history; ancient days.'),
(2744, 'Ancient', 'a.', 'Old; that has been of long duration; of long standing; of\n   great age; as, an ancient forest; an ancient castle.'),
(2745, 'Ancient', 'a.', 'Known for a long time, or from early times; -- opposed to\n   recent or new; as, the ancient continent.'),
(2746, 'Ancient', 'a.', 'Dignified, like an aged man; magisterial; venerable.'),
(2747, 'Ancient', 'a.', 'Experienced; versed.'),
(2748, 'Ancient', 'a.', 'Former; sometime.'),
(2749, 'Ancient', 'n.', 'Those who lived in former ages, as opposed to the moderns.'),
(2750, 'Ancient', 'n.', 'An aged man; a patriarch. Hence: A governor; a ruler; a\n   person of influence.'),
(2751, 'Ancient', 'n.', 'A senior; an elder; a predecessor.'),
(2752, 'Ancient', 'n.', 'One of the senior members of the Inns of Court or of\n   Chancery.'),
(2753, 'Ancient', 'n.', 'An ensign or flag.'),
(2754, 'Ancient', 'n.', 'The bearer of a flag; an ensign.'),
(2755, 'Ancienty', 'n.', 'Age; antiquity.'),
(2756, 'Ancienty', 'n.', 'Seniority.'),
(2757, 'Ancile', 'n.', 'The sacred shield of the Romans, said to have-fallen from\n   heaven in the reign of Numa. It was the palladium of Rome.'),
(2758, 'Ancille', 'n.', 'A maidservant; a handmaid.'),
(2759, 'Ancle', 'n.', 'See Ankle.'),
(2760, 'Ancome', 'n.', 'A small ulcerous swelling, coming suddenly; also, a\n   whitlow.'),
(2761, 'Ancones', 'pl. ', 'of Ancon'),
(2762, 'Ancon', 'n.', 'The olecranon, or the elbow.'),
(2763, 'Ancon', 'n.', 'Alt. of Ancone'),
(2764, 'Ancone', 'n.', 'The corner or quoin of a wall, cross-beam, or rafter.'),
(2765, 'Ancone', 'n.', 'A bracket supporting a cornice; a console.'),
(2766, 'Anconal', 'a.', 'Alt. of Anconeal'),
(2767, 'Anconeal', 'a.', 'Of or pertaining to the ancon or elbow.'),
(2768, 'Anconeus', 'n.', 'A muscle of the elbow and forearm.'),
(2769, 'Anconoid', 'a.', 'Elbowlike; anconal.'),
(2770, 'Ancony', 'n.', 'A piece of malleable iron, wrought into the shape of a bar\n   in the middle, but unwrought at the ends.'),
(2771, '-ancy', '', 'A suffix expressing more strongly than -ance the idea of\n   quality or state; as, constancy, buoyancy, infancy.'),
(2772, 'Andante', 'a.', 'Moving moderately slow, but distinct and flowing; quicker\n   than larghetto, and slower than allegretto.'),
(2773, 'Andante', 'n.', 'A movement or piece in andante time.'),
(2774, 'Andarac', 'n.', 'Red orpiment.'),
(2775, 'Andean', 'a.', 'Pertaining to the Andes.'),
(2776, 'Andesine', 'n.', 'A kind of triclinic feldspar found in the Andes.'),
(2777, 'Andesite', 'n.', 'An eruptive rock allied to trachyte, consisting\n   essentially of a triclinic feldspar, with pyroxene, hornblende, or\n   hypersthene.'),
(2778, 'Andine', 'a.', 'Andean; as, Andine flora.'),
(2779, 'Andiron', 'n.', 'A utensil for supporting wood when burning in a fireplace,\n   one being placed on each side; a firedog; as, a pair of andirons.'),
(2780, 'Android', 'n.', 'Alt. of Androides'),
(2781, 'Android', 'a.', 'Resembling a man.'),
(2782, 'Andron', 'n.', 'The apartment appropriated for the males. This was in the\n   lower part of the house.'),
(2783, 'androus', '', 'A terminal combining form: Having a stamen or stamens;\n   staminate; as, monandrous, with one stamen; polyandrous, with many\n   stamens.'),
(2784, 'Anear', 'prep. & adv.', 'Near.'),
(2785, 'Anear', 'v. t. & i.', 'To near; to approach.'),
(2786, 'Aneath', 'prep. & adv.', 'Beneath.'),
(2787, 'Anecdote', 'n.', 'Unpublished narratives.'),
(2788, 'Anecdote', 'n.', 'A particular or detached incident or fact of an\n   interesting nature; a biographical incident or fragment; a single\n   passage of private life.'),
(2789, 'Anelace', 'n.', 'Same as Anlace.'),
(2790, 'Anele', 'v. t.', 'To anoint.'),
(2791, 'Anele', 'v. t.', 'To give extreme unction to.'),
(2792, 'Anemone', 'n.', 'A genus of plants of the Ranunculus or Crowfoot family;\n   windflower. Some of the species are cultivated in gardens.'),
(2793, 'Anemone', 'n.', 'The sea anemone. See Actinia, and Sea anemone.'),
(2794, 'Anemonic', 'a.', 'An acrid, poisonous, crystallizable substance, obtained\n   from, the anemone, or from anemonin.'),
(2795, 'Anemonin', 'n.', 'An acrid, poisonous, crystallizable substance, obtained\n   from some species of anemone.'),
(2796, 'Anemony', 'n.', 'See Anemone.'),
(2797, 'Anenst', 'a.', 'Alt. of Anent'),
(2798, 'Anent', 'a.', 'Over against; as, he lives anent the church.'),
(2799, 'Anent', 'a.', 'About; concerning; in respect; as, he said nothing anent\n   this particular.'),
(2800, 'Aneroid', 'a.', 'Containing no liquid; -- said of a kind of barometer.'),
(2801, 'Aneroid', 'n.', 'An aneroid barometer.'),
(2802, 'Anethol', 'n.', 'A substance obtained from the volatile oils of anise,\n   fennel, etc., in the form of soft shining scales; -- called also anise\n   camphor.'),
(2803, 'Anetic', 'a.', 'Soothing.'),
(2804, 'Aneurism', 'n.', 'A soft, pulsating, hollow tumor, containing blood,\n   arising from the preternatural dilation or rupture of the coats of an\n   artery.'),
(2805, 'Angel', 'n.', 'A messenger.'),
(2806, 'Angel', 'n.', 'A spiritual, celestial being, superior to man in power and\n   intelligence. In the Scriptures the angels appear as God\'s messengers.'),
(2807, 'Angel', 'n.', 'One of a class of \"fallen angels;\" an evil spirit; as, the\n   devil and his angels.'),
(2808, 'Angel', 'n.', 'A minister or pastor of a church, as in the Seven Asiatic\n   churches.'),
(2809, 'Angel', 'n.', 'Attendant spirit; genius; demon.'),
(2810, 'Angel', 'n.', 'An appellation given to a person supposed to be of angelic\n   goodness or loveliness; a darling.'),
(2811, 'Angel', 'n.', 'An ancient gold coin of England, bearing the figure of the\n   archangel Michael. It varied in value from 6s. 8d. to 10s.'),
(2812, 'Angelage', 'n.', 'Existence or state of angels.'),
(2813, 'Angelet', 'n.', 'A small gold coin formerly current in England; a half\n   angel.'),
(2814, 'Angelic', 'a.', 'Alt. of Angelical'),
(2815, 'Angelic', 'a.', 'Of or derived from angelica; as, angelic acid; angelic\n   ether.'),
(2816, 'Angelica', 'n.', 'An aromatic umbelliferous plant (Archangelica officinalis\n   or Angelica archangelica) the leaf stalks of which are sometimes\n   candied and used in confectionery, and the roots and seeds as an\n   aromatic tonic.'),
(2817, 'Angelica', 'n.', 'The candied leaf stalks of angelica.'),
(2818, 'Angelify', 'v. t.', 'To make like an angel; to angelize.'),
(2819, 'Angelize', 'v. t.', 'To raise to the state of an angel; to render angelic.'),
(2820, 'Angelot', 'n.', 'A French gold coin of the reign of Louis XI., bearing the\n   image of St. Michael; also, a piece coined at Paris by the English\n   under Henry VI.'),
(2821, 'Angelot', 'n.', 'An instrument of music, of the lute kind, now disused.'),
(2822, 'Angelot', 'n.', 'A sort of small, rich cheese, made in Normandy.'),
(2823, 'Angelus', 'n.', 'A form of devotion in which three Ave Marias are repeated.\n   It is said at morning, noon, and evening, at the sound of a bell.'),
(2824, 'Angelus', 'n.', 'The Angelus bell.'),
(2825, 'Anger', 'n.', 'Trouble; vexation; also, physical pain or smart of a sore,\n   etc.'),
(2826, 'Anger', 'n.', 'A strong passion or emotion of displeasure or antagonism,\n   excited by a real or supposed injury or insult to one\'s self or others,\n   or by the intent to do such injury.'),
(2827, 'Angered', 'imp. & p. p.', 'of Anger'),
(2828, 'Angering', 'p. pr. & vb. n.', 'of Anger'),
(2829, 'Anger', 'v. t.', 'To make painful; to cause to smart; to inflame.'),
(2830, 'Anger', 'v. t.', 'To excite to anger; to enrage; to provoke.'),
(2831, 'Angerly', 'adv.', 'Angrily.'),
(2832, 'Angevine', 'a.', 'Of or pertaining to Anjou in France.'),
(2833, 'Angevine', 'n.', 'A native of Anjou.'),
(2834, 'Angina', 'n.', 'Any inflammatory affection of the throat or faces, as the\n   quinsy, malignant sore throat, croup, etc., especially such as tends to\n   produce suffocation, choking, or shortness of breath.'),
(2835, 'Anginous', 'a.', 'Alt. of Anginose'),
(2836, 'Anginose', 'a.', 'Pertaining to angina or angina pectoris.'),
(2837, 'Angio-', '', 'A prefix, or combining form, in numerous compounds, usually\n   relating to seed or blood vessels, or to something contained in, or\n   covered by, a vessel.'),
(2838, 'Angioma', 'n.', 'A tumor composed chiefly of dilated blood vessels.'),
(2839, 'Angle', 'n.', 'The inclosed space near the point where two lines meet; a\n   corner; a nook.'),
(2840, 'Angle', 'n.', 'The figure made by. two lines which meet.'),
(2841, 'Angle', 'n.', 'The difference of direction of two lines. In the lines meet,\n   the point of meeting is the vertex of the angle.'),
(2842, 'Angle', 'n.', 'A projecting or sharp corner; an angular fragment.'),
(2843, 'Angle', 'n.', 'A name given to four of the twelve astrological \"houses.\"'),
(2844, 'Angle', 'n.', 'A fishhook; tackle for catching fish, consisting of a line,\n   hook, and bait, with or without a rod.'),
(2845, 'Angled', 'imp. & p. p.', 'of Angle'),
(2846, 'Angling', 'p. pr. & vb. n.', 'of Angle'),
(2847, 'Angle', 'v. i.', 'To fish with an angle (fishhook), or with hook and line.'),
(2848, 'Angle', 'v. i.', 'To use some bait or artifice; to intrigue; to scheme; as,\n   to angle for praise.'),
(2849, 'Angle', 'v. t.', 'To try to gain by some insinuating artifice; to allure.'),
(2850, 'Angled', 'a.', 'Having an angle or angles; -- used in compounds; as,\n   right-angled, many-angled, etc.'),
(2851, 'Angler', 'n.', 'One who angles.'),
(2852, 'Angler', 'n.', 'A fish (Lophius piscatorius), of Europe and America, having\n   a large, broad, and depressed head, with the mouth very large. Peculiar\n   appendages on the head are said to be used to entice fishes within\n   reach. Called also fishing frog, frogfish, toadfish, goosefish,\n   allmouth, monkfish, etc.'),
(2853, 'Angles', 'n. pl.', 'An ancient Low German tribe, that settled in Britain,\n   which came to be called Engla-land (Angleland or England). The Angles\n   probably came from the district of Angeln (now within the limits of\n   Schleswig), and the country now Lower Hanover, etc.'),
(2854, 'Anglian', 'a.', 'Of or pertaining to the Angles.'),
(2855, 'Anglian', 'n.', 'One of the Angles.'),
(2856, 'Anglic', 'a.', 'Anglian.'),
(2857, 'Anglican', 'a.', 'English; of or pertaining to England or the English\n   nation; especially, pertaining to, or connected with, the established\n   church of England; as, the Anglican church, doctrine, orders, ritual,\n   etc.'),
(2858, 'Anglican', 'a.', 'Pertaining to, characteristic of, or held by, the high\n   church party of the Church of England.'),
(2859, 'Anglican', 'n.', 'A member of the Church of England.'),
(2860, 'Anglican', 'n.', 'In a restricted sense, a member of the High Church party,\n   or of the more advanced ritualistic section, in the Church of England.'),
(2861, 'Anglice', 'adv.', 'In English; in the English manner; as, Livorno, Anglice\n   Leghorn.'),
(2862, 'Anglify', 'v. t.', 'To convert into English; to anglicize.'),
(2863, 'Angling', 'n.', 'The act of one who angles; the art of fishing with rod and\n   line.'),
(2864, 'Anglo-', '', 'A combining form meaning the same as English; or English and,\n   or English conjoined with; as, Anglo-Turkish treaty, Anglo-German,\n   Anglo-Irish.'),
(2865, 'Angola', 'n.', 'A fabric made from the wool of the Angora goat.'),
(2866, 'Angor', 'n.', 'Great anxiety accompanied by painful constriction at the\n   upper part of the belly, often with palpitation and oppression.'),
(2867, 'Angora', 'n.', 'A city of Asia Minor (or Anatolia) which has given its name\n   to a goat, a cat, etc.'),
(2868, 'Angrily', 'adv.', 'In an angry manner; under the influence of anger.'),
(2869, 'Angry', 'superl.', 'Troublesome; vexatious; rigorous.'),
(2870, 'Angry', 'superl.', 'Inflamed and painful, as a sore.'),
(2871, 'Angry', 'superl.', 'Touched with anger; under the emotion of anger; feeling\n   resentment; enraged; -- followed generally by with before a person, and\n   at before a thing.'),
(2872, 'Angry', 'superl.', 'Showing anger; proceeding from anger; acting as if\n   moved by anger; wearing the marks of anger; as, angry words or tones;\n   an angry sky; angry waves.'),
(2873, 'Angry', 'superl.', 'Red.'),
(2874, 'Angry', 'superl.', 'Sharp; keen; stimulated.'),
(2875, 'Anguine', 'a.', 'Of, pertaining to, or resembling, a snake or serpent.'),
(2876, 'Anguish', 'n.', 'Extreme pain, either of body or mind; excruciating\n   distress.'),
(2877, 'Anguish', 'v. t.', 'To distress with extreme pain or grief.'),
(2878, 'Angular', 'a.', 'Relating to an angle or to angles; having an angle or\n   angles; forming an angle or corner; sharp-cornered; pointed; as, an\n   angular figure.'),
(2879, 'Angular', 'a.', 'Measured by an angle; as, angular distance.'),
(2880, 'Angular', 'a.', 'Fig.: Lean; lank; raw-boned; ungraceful; sharp and stiff\n   in character; as, remarkably angular in his habits and appearance; an\n   angular female.'),
(2881, 'Angular', 'n.', 'A bone in the base of the lower jaw of many birds,\n   reptiles, and fishes.'),
(2882, 'Angulate', 'a.', 'Alt. of Angulated'),
(2883, 'Angulate', 'v. t.', 'To make angular.'),
(2884, 'Angulose', 'a.', 'Angulous.'),
(2885, 'Angulous', 'a.', 'Angular; having corners; hooked.'),
(2886, 'Angust', 'a.', 'Narrow; strait.'),
(2887, 'Anhang', 'v. t.', 'To hang.'),
(2888, 'Anhele', 'v. i.', 'To pant; to be breathlessly anxious or eager (for).'),
(2889, 'Anhelose', 'a.', 'Anhelous; panting.'),
(2890, 'Anhelous', 'a.', 'Short of breath; panting.'),
(2891, 'Anhima', 'n.', 'A South American aquatic bird; the horned screamer or\n   kamichi (Palamedea cornuta). See Kamichi.'),
(2892, 'Anhinga', 'n.', 'An aquatic bird of the southern United States (Platus\n   anhinga); the darter, or snakebird.'),
(2893, 'Anicut', 'n.', 'Alt. of Annicut'),
(2894, 'Annicut', 'n.', 'A dam or mole made in the course of a stream for the\n   purpose of regulating the flow of a system of irrigation.'),
(2895, 'Anient', 'v. t.', 'Alt. of Anientise'),
(2896, 'Anigh', 'prep. & adv.', 'Nigh.'),
(2897, 'Anight', 'adv.', 'Alt. of Anights'),
(2898, 'Anights', 'adv.', 'In the night time; at night.'),
(2899, 'Anile', 'a.', 'Old-womanish; imbecile.'),
(2900, 'Anilic', 'a.', 'Pertaining to, or obtained from, anil; indigotic; --\n   applied to an acid formed by the action of nitric acid on indigo.'),
(2901, 'Anilide', 'n.', 'One of a class of compounds which may be regarded as\n   amides in which more or less of the hydrogen has been replaced by\n   phenyl.'),
(2902, 'Aniline', 'n.', 'An organic base belonging to the phenylamines. It may be\n   regarded as ammonia in which one hydrogen atom has been replaced by the\n   radical phenyl. It is a colorless, oily liquid, originally obtained\n   from indigo by distillation, but now largely manufactured from coal tar\n   or nitrobenzene as a base from which many brilliant dyes are made.'),
(2903, 'Aniline', 'a.', 'Made from, or of the nature of, aniline.'),
(2904, 'Anility', 'n.', 'The state of being and old woman; old-womanishness;\n   dotage.'),
(2905, 'Animal', 'n.', 'An organized living being endowed with sensation and the\n   power of voluntary motion, and also characterized by taking its food\n   into an internal cavity or stomach for digestion; by giving carbonic\n   acid to the air and taking oxygen in the process of respiration; and by\n   increasing in motive power or active aggressive force with progress to\n   maturity.'),
(2906, 'Animal', 'n.', 'One of the lower animals; a brute or beast, as\n   distinguished from man; as, men and animals.'),
(2907, 'Animal', 'a.', 'Of or relating to animals; as, animal functions.'),
(2908, 'Animal', 'a.', 'Pertaining to the merely sentient part of a creature, as\n   distinguished from the intellectual, rational, or spiritual part; as,\n   the animal passions or appetites.'),
(2909, 'Animal', 'a.', 'Consisting of the flesh of animals; as, animal food.'),
(2910, 'Animally', 'adv.', 'Physically.'),
(2911, 'Animated', 'imp. & p. p.', 'of Animate'),
(2912, 'Animate', 'v. t.', 'To give natural life to; to make alive; to quicken; as,\n   the soul animates the body.'),
(2913, 'Animate', 'v. t.', 'To give powers to, or to heighten the powers or effect\n   of; as, to animate a lyre.'),
(2914, 'Animate', 'v. t.', 'To give spirit or vigor to; to stimulate or incite; to\n   inspirit; to rouse; to enliven.'),
(2915, 'Animate', 'a.', 'Endowed with life; alive; living; animated; lively.'),
(2916, 'Animated', 'a.', 'Endowed with life; full of life or spirit; indicating\n   animation; lively; vigorous.'),
(2917, 'Animater', 'n.', 'One who animates.'),
(2918, 'Animator', 'n.', 'One who, or that which, animates; an animater.'),
(2919, 'Anime', 'a.', 'Of a different tincture from the animal itself; -- said of\n   the eyes of a rapacious animal.'),
(2920, 'Anime', 'n.', 'A resin exuding from a tropical American tree (Hymenaea\n   courbaril), and much used by varnish makers.'),
(2921, 'Animism', 'n.', 'The doctrine, taught by Stahl, that the soul is the proper\n   principle of life and development in the body.'),
(2922, 'Animism', 'n.', 'The belief that inanimate objects and the phenomena of\n   nature are endowed with personal life or a living soul; also, in an\n   extended sense, the belief in the existence of soul or spirit apart\n   from matter.'),
(2923, 'Animist', 'n.', 'One who maintains the doctrine of animism.'),
(2924, 'Animose', 'a.', 'Alt. of Animous'),
(2925, 'Animous', 'a.', 'Full of spirit; hot; vehement; resolute.'),
(2926, 'Animi', 'pl. ', 'of Animus'),
(2927, 'Animus', 'n.', 'Animating spirit; intention; temper.'),
(2928, 'Anion', 'n.', 'An electro-negative element, or the element which, in\n   electro-chemical decompositions, is evolved at the anode; -- opposed to\n   cation.'),
(2929, 'Anise', 'n.', 'An umbelliferous plant (Pimpinella anisum) growing naturally\n   in Egypt, and cultivated in Spain, Malta, etc., for its carminative and\n   aromatic seeds.'),
(2930, 'Anise', 'n.', 'The fruit or seeds of this plant.'),
(2931, 'Aniseed', 'n.', 'The seed of the anise; also, a cordial prepared from it.'),
(2932, 'Anisette', 'n.', 'A French cordial or liqueur flavored with anise seeds.'),
(2933, 'Anisic', 'a.', 'Of or derived from anise; as, anisic acid; anisic alcohol.'),
(2934, 'Anker', 'n.', 'A liquid measure in various countries of Europe. The Dutch\n   anker, formerly also used in England, contained about 10 of the old\n   wine gallons, or 8/ imperial gallons.'),
(2935, 'Ankerite', 'n.', 'A mineral closely related to dolomite, but containing\n   iron.'),
(2936, 'Ankle', 'n.', 'The joint which connects the foot with the leg; the tarsus.'),
(2937, 'Ankled', 'a.', 'Having ankles; -- used in composition; as, well-ankled.'),
(2938, 'Anklet', 'n.', 'An ornament or a fetter for the ankle; an ankle ring.'),
(2939, 'Ankylose', 'v. t. & i.', 'Same as Anchylose.'),
(2940, 'Anlace', 'n.', 'A broad dagger formerly worn at the girdle.'),
(2941, 'Annat', 'n.', 'A half years\'s stipend, over and above what is owing for the\n   incumbency, due to a minister\'s heirs after his decease.'),
(2942, 'Annal', 'n.', 'See Annals.'),
(2943, 'Annalist', 'n.', 'A writer of annals.'),
(2944, 'Annalize', 'v. t.', 'To record in annals.'),
(2945, 'Annals', 'n. pl.', 'A relation of events in chronological order, each event\n   being recorded under the year in which it happened.'),
(2946, 'Annals', 'n. pl.', 'Historical records; chronicles; history.'),
(2947, 'Annals', 'n. pl.', 'The record of a single event or item.'),
(2948, 'Annals', 'n. pl.', 'A periodic publication, containing records of\n   discoveries, transactions of societies, etc.; as \"Annals of Science.\"'),
(2949, 'Annats', 'n. pl.', 'Alt. of Annates'),
(2950, 'Annates', 'n. pl.', 'The first year\'s profits of a spiritual preferment,\n   anciently paid by the clergy to the pope; first fruits. In England,\n   they now form a fund for the augmentation of poor livings.'),
(2951, 'Annealed', 'imp. & p. p.', 'of Anneal'),
(2952, 'Anneal', 'v. t.', 'To subject to great heat, and then cool slowly, as\n   glass, cast iron, steel, or other metal, for the purpose of rendering\n   it less brittle; to temper; to toughen.'),
(2953, 'Anneal', 'v. t.', 'To heat, as glass, tiles, or earthenware, in order to\n   fix the colors laid on them.'),
(2954, 'Annealer', 'n.', 'One who, or that which, anneals.'),
(2955, 'Annelid', 'a.', 'Alt. of Annelidan'),
(2956, 'Annelida', 'n. pl.', 'A division of the Articulata, having the body formed\n   of numerous rings or annular segments, and without jointed legs. The\n   principal subdivisions are the Chaetopoda, including the Oligochaeta or\n   earthworms and Polychaeta or marine worms; and the Hirudinea or\n   leeches. See Chaetopoda.'),
(2957, 'Anneloid', 'n.', 'An animal resembling an annelid.'),
(2958, 'Annexed', 'imp. & p. p.', 'of Annex'),
(2959, 'Annexing', 'p. pr. & vb. n.', 'of Annex'),
(2960, 'Annex', 'v. t.', 'To join or attach; usually to subjoin; to affix; to\n   append; -- followed by to.'),
(2961, 'Annex', 'v. t.', 'To join or add, as a smaller thing to a greater.'),
(2962, 'Annex', 'v. t.', 'To attach or connect, as a consequence, condition, etc.;\n   as, to annex a penalty to a prohibition, or punishment to guilt.'),
(2963, 'Annex', 'v. i.', 'To join; to be united.'),
(2964, 'Annex', 'n.', 'Something annexed or appended; as, an additional stipulation\n   to a writing, a subsidiary building to a main building; a wing.'),
(2965, 'Annexer', 'n.', 'One who annexes.'),
(2966, 'Annexion', 'n.', 'Annexation.'),
(2967, 'Annotate', 'n.', 'To explain or criticize by notes; as, to annotate the\n   works of Bacon.'),
(2968, 'Annotate', 'v. i.', 'To make notes or comments; -- with on or upon.'),
(2969, 'Annotine', 'n.', 'A bird one year old, or that has once molted.'),
(2970, 'Annotto', 'n.', 'Alt. of Arnotto'),
(2971, 'Arnotto', 'n.', 'A red or yellowish-red dyeing material, prepared from the\n   pulp surrounding the seeds of a tree (Bixa orellana) belonging to the\n   tropical regions of America. It is used for coloring cheese, butter,\n   etc.'),
(2972, 'Announce', 'v. t.', 'To give public notice, or first notice of; to make\n   known; to publish; to proclaim.'),
(2973, 'Announce', 'v. t.', 'To pronounce; to declare by judicial sentence.'),
(2974, 'Annoyed', 'imp. & p. p.', 'of Annoy'),
(2975, 'Annoying', 'p. pr. & vb. n.', 'of Annoy'),
(2976, 'Annoy', 'n.', 'To disturb or irritate, especially by continued or repeated\n   acts; to tease; to ruffle in mind; to vex; as, I was annoyed by his\n   remarks.'),
(2977, 'Annoy', 'n.', 'To molest, incommode, or harm; as, to annoy an army by\n   impeding its march, or by a cannonade.'),
(2978, 'Annoy', 'n.', 'A feeling of discomfort or vexation caused by what one\n   dislikes; also, whatever causes such a feeling; as, to work annoy.'),
(2979, 'Annoyer', 'n.', 'One who, or that which, annoys.'),
(2980, 'Annoyful', 'a.', 'Annoying.'),
(2981, 'Annoying', 'a.', 'That annoys; molesting; vexatious.'),
(2982, 'Annoyous', 'a.', 'Troublesome; annoying.'),
(2983, 'Annual', 'a.', 'Of or pertaining to a year; returning every year; coming or\n   happening once in the year; yearly.'),
(2984, 'Annual', 'a.', 'Performed or accomplished in a year; reckoned by the year;\n   as, the annual motion of the earth.'),
(2985, 'Annual', 'a.', 'Lasting or continuing only one year or one growing season;\n   requiring to be renewed every year; as, an annual plant; annual\n   tickets.'),
(2986, 'Annual', 'n.', 'A thing happening or returning yearly; esp. a literary work\n   published once a year.'),
(2987, 'Annual', 'n.', 'Anything, especially a plant, that lasts but one year or\n   season; an annual plant.'),
(2988, 'Annual', 'n.', 'A Mass for a deceased person or for some special object,\n   said daily for a year or on the anniversary day.'),
(2989, 'Annually', 'adv.', 'Yearly; year by year.'),
(2990, 'Annuary', 'a.', 'Annual.'),
(2991, 'Annuary', 'n.', 'A yearbook.'),
(2992, 'Annueler', 'n.', 'A priest employed in saying annuals, or anniversary\n   Masses.'),
(2993, 'Annuent', 'a.', 'Nodding; as, annuent muscles (used in nodding).'),
(2994, 'Annuity', 'n.', 'A sum of money, payable yearly, to continue for a given\n   number of years, for life, or forever; an annual allowance.'),
(2995, 'Annulled', 'imp. & p. p.', 'of Annul'),
(2996, 'Annul', 'a.', 'To reduce to nothing; to obliterate.'),
(2997, 'Annul', 'a.', 'To make void or of no effect; to nullify; to abolish; to do\n   away with; -- used appropriately of laws, decrees, edicts, decisions of\n   courts, or other established rules, permanent usages, and the like,\n   which are made void by component authority.'),
(2998, 'Annular', 'a.', 'Pertaining to, or having the form of, a ring; forming a\n   ring; ringed; ring-shaped; as, annular fibers.'),
(2999, 'Annular', 'a.', 'Banded or marked with circles.'),
(3000, 'Annulary', 'a.', 'Having the form of a ring; annular.'),
(3001, 'Annulata', 'n. pl.', 'A class of articulate animals, nearly equivalent to\n   Annelida, including the marine annelids, earthworms, Gephyrea,\n   Gymnotoma, leeches, etc. See Annelida.'),
(3002, 'Annulate', 'n.', 'One of the Annulata.'),
(3003, 'Annulate', 'a.', 'Alt. of Annulated'),
(3004, 'Annulet', 'n.', 'A little ring.'),
(3005, 'Annulet', 'n.', 'A small, flat fillet, encircling a column, etc., used by\n   itself, or with other moldings. It is used, several times repeated,\n   under the Doric capital.'),
(3006, 'Annulet', 'n.', 'A little circle borne as a charge.'),
(3007, 'Annulet', 'n.', 'A narrow circle of some distinct color on a surface or\n   round an organ.'),
(3008, 'Annuller', 'n.', 'One who annuls.'),
(3009, 'Annuloid', 'a.', 'Of or pertaining to the Annuloida.'),
(3010, 'Annulosa', 'n. pl.', 'A division of the Invertebrata, nearly equivalent to\n   the Articulata. It includes the Arthoropoda and Anarthropoda. By some\n   zoologists it is applied to the former only.'),
(3011, 'Annulose', 'a.', 'Furnished with, or composed of, rings or ringlike\n   segments; ringed.'),
(3012, 'Annulose', 'a.', 'Of or pertaining to the Annulosa.'),
(3013, 'Annuli', 'pl. ', 'of Annulus'),
(3014, 'Annulus', 'n.', 'A ring; a ringlike part or space.'),
(3015, 'Annulus', 'n.', 'A space contained between the circumferences of two\n   circles, one within the other.'),
(3016, 'Annulus', 'n.', 'The solid formed by a circle revolving around a line which\n   is the plane of the circle but does not cut it.'),
(3017, 'Annulus', 'n.', 'Ring-shaped structures or markings, found in, or upon,\n   various animals.'),
(3018, 'Anode', 'n.', 'The positive pole of an electric battery, or more strictly\n   the electrode by which the current enters the electrolyte on its way to\n   the other pole; -- opposed to cathode.'),
(3019, 'Anodon', 'n.', 'A genus of fresh-water bivalves, having no teeth at the\n   hinge.'),
(3020, 'Anodyne', 'a.', 'Serving to assuage pain; soothing.'),
(3021, 'Anodyne', 'a.', 'Any medicine which allays pain, as an opiate or narcotic;\n   anything that soothes disturbed feelings.'),
(3022, 'Anoil', 'v. t.', 'To anoint with oil.'),
(3023, 'Anointed', 'imp. & p. p.', 'of Anoint'),
(3024, 'Anoint', 'v. t.', 'To smear or rub over with oil or an unctuous substance;\n   also, to spread over, as oil.'),
(3025, 'Anoint', 'v. t.', 'To apply oil to or to pour oil upon, etc., as a sacred\n   rite, especially for consecration.'),
(3026, 'Anoint', 'p. p.', 'Anointed.'),
(3027, 'Anointer', 'n.', 'One who anoints.'),
(3028, 'Anolis', 'n.', 'A genus of lizards which belong to the family Iguanidae.\n   They take the place in the New World of the chameleons in the Old, and\n   in America are often called chameleons.'),
(3029, 'Anomal', 'n.', 'Anything anomalous.'),
(3030, 'Anomaly', 'n.', 'Deviation from the common rule; an irregularity; anything\n   anomalous.'),
(3031, 'Anomaly', 'n.', 'The angular distance of a planet from its perihelion, as\n   seen from the sun. This is the true anomaly. The eccentric anomaly is a\n   corresponding angle at the center of the elliptic orbit of the planet.\n   The mean anomaly is what the anomaly would be if the planet\'s angular\n   motion were uniform.'),
(3032, 'Anomaly', 'n.', 'The angle measuring apparent irregularities in the motion\n   of a planet.'),
(3033, 'Anomaly', 'n.', 'Any deviation from the essential characteristics of a\n   specific type.'),
(3034, 'Anomia', 'n.', 'A genus of bivalve shells, allied to the oyster, so called\n   from their unequal valves, of which the lower is perforated for\n   attachment.'),
(3035, 'Anomura', 'n. pl.', 'Alt. of Anomoura'),
(3036, 'Anomoura', 'n. pl.', 'A group of decapod Crustacea, of which the hermit\n   crab in an example.'),
(3037, 'Anomural', 'a.', 'Alt. of Anomuran'),
(3038, 'Anomuran', 'a.', 'Irregular in the character of the tail or abdomen; as,\n   the anomural crustaceans.'),
(3039, 'Anomuran', 'n.', 'One of the Anomura.'),
(3040, 'Anomy', 'n.', 'Disregard or violation of law.'),
(3041, 'Anona', 'n.', 'A genus of tropical or subtropical plants of the natural\n   order Anonaceae, including the soursop.'),
(3042, 'Anonym', 'n.', 'One who is anonymous; also sometimes used for \"pseudonym.\"'),
(3043, 'Anonym', 'n.', 'A notion which has no name, or which can not be expressed\n   by a single English word.'),
(3044, 'Anophyte', 'n.', 'A moss or mosslike plant which cellular stems, having\n   usually an upward growth and distinct leaves.'),
(3045, 'Anopla', 'n. pl.', 'One of the two orders of Nemerteans. See Nemertina.'),
(3046, 'Anoplura', 'n. pl.', 'A group of insects which includes the lice.'),
(3047, 'Anopsia', 'a.', 'Alt. of Anopsy'),
(3048, 'Anopsy', 'a.', 'Want or defect of sight; blindness.'),
(3049, 'Anorexia', 'n.', 'Alt. of Anorexy'),
(3050, 'Anorexy', 'n.', 'Want of appetite, without a loathing of food.'),
(3051, 'Anormal', 'a.', 'Not according to rule; abnormal.'),
(3052, 'Anorn', 'v. t.', 'To adorn.'),
(3053, 'Anorthic', 'a.', 'Having unequal oblique axes; as, anorthic crystals.'),
(3054, 'Anosmia', 'n.', 'Loss of the sense of smell.'),
(3055, 'Another', 'pron. & a.', 'One more, in addition to a former number; a second\n   or additional one, similar in likeness or in effect.'),
(3056, 'Another', 'pron. & a.', 'Not the same; different.'),
(3057, 'Another', 'pron. & a.', 'Any or some; any different person, indefinitely;\n   any one else; some one else.'),
(3058, 'Anotta', 'n.', 'See Annotto.'),
(3059, 'Anoura', 'n.', 'See Anura.'),
(3060, 'Anourous', 'a.', 'See Anurous.'),
(3061, 'Ansae', 'pl. ', 'of Ansa'),
(3062, 'Ansated', 'a.', 'Having a handle.'),
(3063, 'Anseres', 'n. pl.', 'A Linnaean order of aquatic birds swimming by means of\n   webbed feet, as the duck, or of lobed feet, as the grebe. In this order\n   were included the geese, ducks, auks, divers, gulls, petrels, etc.'),
(3064, 'Anserine', 'a.', 'Pertaining to, or resembling, a goose, or the skin of a\n   goose.'),
(3065, 'Anserine', 'a.', 'Pertaining to the Anseres.'),
(3066, 'Anserous', 'a.', 'Resembling a goose; silly; simple.'),
(3067, 'Answered', 'imp. & p. p.', 'of Answer'),
(3068, 'Answer', 'n.', 'To speak in defense against; to reply to in defense; as, to\n   answer a charge; to answer an accusation.'),
(3069, 'Answer', 'n.', 'To speak or write in return to, as in return to a call or\n   question, or to a speech, declaration, argument, or the like; to reply\n   to (a question, remark, etc.); to respond to.'),
(3070, 'Answer', 'n.', 'To respond to satisfactorily; to meet successfully by way\n   of explanation, argument, or justification, and the like; to refute.'),
(3071, 'Answer', 'n.', 'To be or act in return or response to.'),
(3072, 'Answer', 'n.', 'To be or act in compliance with, in fulfillment or\n   satisfaction of, as an order, obligation, demand; as, he answered my\n   claim upon him; the servant answered the bell.'),
(3073, 'Answer', 'n.', 'To render account to or for.'),
(3074, 'Answer', 'n.', 'To atone; to be punished for.'),
(3075, 'Answer', 'n.', 'To be opposite to; to face.'),
(3076, 'Answer', 'n.', 'To be or act an equivalent to, or as adequate or sufficient\n   for; to serve for; to repay.'),
(3077, 'Answer', 'n.', 'To be or act in accommodation, conformity, relation, or\n   proportion to; to correspond to; to suit.'),
(3078, 'Answer', 'v. i.', 'To speak or write by way of return (originally, to a\n   charge), or in reply; to make response.'),
(3079, 'Answer', 'v. i.', 'To make a satisfactory response or return.'),
(3080, 'Answer', 'v. i.', 'To render account, or to be responsible; to be\n   accountable; to make amends; as, the man must answer to his employer\n   for the money intrusted to his care.'),
(3081, 'Answer', 'v. i.', 'To be or act in return.'),
(3082, 'Answer', 'v. i.', 'To be or act by way of compliance, fulfillment,\n   reciprocation, or satisfaction; to serve the purpose; as, gypsum\n   answers as a manure on some soils.'),
(3083, 'Answer', 'v. i.', 'To be opposite, or to act in opposition.'),
(3084, 'Answer', 'v. i.', 'To be or act as an equivalent, or as adequate or\n   sufficient; as, a very few will answer.'),
(3085, 'Answer', 'v. i.', 'To be or act in conformity, or by way of accommodation,\n   correspondence, relation, or proportion; to conform; to correspond; to\n   suit; -- usually with to.'),
(3086, 'Answer', 'n.', 'A reply to a change; a defense.'),
(3087, 'Answer', 'n.', 'Something said or written in reply to a question, a call,\n   an argument, an address, or the like; a reply.'),
(3088, 'Answer', 'n.', 'Something done in return for, or in consequence of,\n   something else; a responsive action.'),
(3089, 'Answer', 'n.', 'A solution, the result of a mathematical operation; as, the\n   answer to a problem.'),
(3090, 'Answer', 'n.', 'A counter-statement of facts in a course of pleadings; a\n   confutation of what the other party has alleged; a responsive\n   declaration by a witness in reply to a question. In Equity, it is the\n   usual form of defense to the complainant\'s charges in his bill.'),
(3091, 'Answerer', 'n.', 'One who answers.'),
(3092, 'Antae', 'pl. ', 'of Anta'),
(3093, 'Antacid', 'n.', 'A remedy for acidity of the stomach, as an alkali or\n   absorbent.'),
(3094, 'Antacid', 'a.', 'Counteractive of acidity.'),
(3095, 'Antacrid', 'a.', 'Corrective of acrimony of the humors.'),
(3096, 'Antaean', 'a.', 'Pertaining to Antaeus, a giant athlete slain by Hercules.'),
(3097, 'Antagony', 'n.', 'Contest; opposition; antagonism.'),
(3098, 'Antalgic', 'a.', 'Alleviating pain.'),
(3099, 'Antalgic', 'n.', 'A medicine to alleviate pain; an anodyne.'),
(3100, 'Antares', 'n.', 'The principal star in Scorpio: -- called also the\n   Scorpion\'s Heart.'),
(3101, 'Ant-bear', 'n.', 'An edentate animal of tropical America (the Tamanoir),\n   living on ants. It belongs to the genus Myrmecophaga.'),
(3102, 'Ant bird', '', 'See Ant bird, under Ant, n.'),
(3103, 'Ante-', '', 'A Latin preposition and prefix; akin to Gr. \'anti`, Skr. anti,\n   Goth. and-, anda- (only in comp.), AS. and-, ond-, (only in comp.: cf.\n   Answer, Along), G. ant-, ent- (in comp.). The Latin ante is generally\n   used in the sense of before, in regard to position, order, or time, and\n   the Gr. \'anti` in that of opposite, or in the place of.'),
(3104, 'Anteact', 'n.', 'A preceding act.'),
(3105, 'Anteal', 'a.', 'Being before, or in front.'),
(3106, 'Antecede', 'v. t. & i.', 'To go before in time or place; to precede; to\n   surpass.'),
(3107, 'Antedate', 'n.', 'Prior date; a date antecedent to another which is the\n   actual date.'),
(3108, 'Antedate', 'n.', 'Anticipation.'),
(3109, 'Antedate', 'v. t.', 'To date before the true time; to assign to an earlier\n   date; thus, to antedate a deed or a bond is to give it a date anterior\n   to the true time of its execution.'),
(3110, 'Antedate', 'v. t.', 'To precede in time.'),
(3111, 'Antedate', 'v. t.', 'To anticipate; to make before the true time.'),
(3112, 'Antefact', 'n.', 'Something done before another act.'),
(3113, 'Antefixa', 'pl. ', 'of Antefix'),
(3114, 'Antefix', 'n.', 'An ornament fixed upon a frieze.'),
(3115, 'Antefix', 'n.', 'An ornament at the eaves, concealing the ends of the joint\n   tiles of the roof.'),
(3116, 'Antefix', 'n.', 'An ornament of the cymatium of a classic cornice,\n   sometimes pierced for the escape of water.'),
(3117, 'Ant egg', '', 'One of the small white egg-shaped pupae or cocoons of the\n   ant, often seen in or about ant-hills, and popularly supposed to be\n   eggs.'),
(3118, 'Antelope', 'n.', 'One of a group of ruminant quadrupeds, intermediate\n   between the deer and the goat. The horns are usually annulated, or\n   ringed. There are many species in Africa and Asia.'),
(3119, 'Antennae', 'pl. ', 'of Antenna'),
(3120, 'Antenna', 'n.', 'A movable, articulated organ of sensation, attached to the\n   heads of insects and Crustacea. There are two in the former, and\n   usually four in the latter. They are used as organs of touch, and in\n   some species of Crustacea the cavity of the ear is situated near the\n   basal joint. In insects, they are popularly called horns, and also\n   feelers. The term in also applied to similar organs on the heads of\n   other arthropods and of annelids.'),
(3121, 'Antennal', 'a.', 'Belonging to the antennae.'),
(3122, 'Antepast', 'n.', 'A foretaste.'),
(3123, 'Antepone', 'v. t.', 'To put before; to prefer.'),
(3124, 'Anteport', 'n.', 'An outer port, gate, or door.'),
(3125, 'Anterior', 'a.', 'Before in time; antecedent.'),
(3126, 'Anterior', 'a.', 'Before, or toward the front, in place; as, the anterior\n   part of the mouth; -- opposed to posterior.'),
(3127, 'Anteroom', 'n.', 'A room before, or forming an entrance to, another; a\n   waiting room.'),
(3128, 'Antero-', '', 'A combining form meaning anterior, front; as,\n   antero-posterior, front and back; antero-lateral, front side, anterior\n   and at the side.'),
(3129, 'Antes', 'n. pl.', 'Antae. See Anta.'),
(3130, 'Antevert', 'v. t.', 'To prevent.'),
(3131, 'Antevert', 'v. t.', 'To displace by anteversion.'),
(3132, 'Anthelia', 'pl. ', 'of Anthelion'),
(3133, 'Anthelix', 'n.', 'Same as Antihelix.'),
(3134, 'Anthem', 'n.', 'Formerly, a hymn sung in alternate parts, in present usage,\n   a selection from the Psalms, or other parts of the Scriptures or the\n   liturgy, set to sacred music.'),
(3135, 'Anthem', 'n.', 'A song or hymn of praise.'),
(3136, 'Anthem', 'v. t.', 'To celebrate with anthems.'),
(3137, 'Anthemis', 'n.', 'Chamomile; a genus of composite, herbaceous plants.'),
(3138, 'Anther', 'n.', 'That part of the stamen containing the pollen, or\n   fertilizing dust, which, when mature, is emitted for the impregnation\n   of the ovary.'),
(3139, 'Anthesis', 'n.', 'The period or state of full expansion in a flower.'),
(3140, 'Ant-hill', 'n.', 'A mound thrown up by ants or by termites in forming their\n   nests.'),
(3141, 'Anthoid', 'a.', 'Resembling a flower; flowerlike.'),
(3142, 'Anthozoa', 'n. pl.', 'The class of the Coelenterata which includes the\n   corals and sea anemones. The three principal groups or orders are\n   Acyonaria, Actinaria, and Madreporaria.'),
(3143, 'Anthrax', 'n.', 'A carbuncle.'),
(3144, 'Anthrax', 'n.', 'A malignant pustule.'),
(3145, 'Anthrax', 'n.', 'A microscopic, bacterial organism (Bacillus anthracis),\n   resembling transparent rods. [See Illust. under Bacillus.]'),
(3146, 'Anthrax', 'n.', 'An infectious disease of cattle and sheep. It is ascribed\n   to the presence of a rod-shaped bacterium (Bacillus anthracis), the\n   spores of which constitute the contagious matter. It may be transmitted\n   to man by inoculation. The spleen becomes greatly enlarged and filled\n   with bacteria. Called also splenic fever.'),
(3147, 'Antiae', 'n. pl.', 'The two projecting feathered angles of the forehead of\n   some birds; the frontal points.'),
(3148, 'Antiar', 'n.', 'A Virulent poison prepared in Java from the gum resin of\n   one species of the upas tree (Antiaris toxicaria).'),
(3149, 'Antiarin', 'n.', 'A poisonous principle obtained from antiar.'),
(3150, 'Antic', 'a.', 'Old; antique.'),
(3151, 'Antic', 'a.', ''),
(3152, 'Antic', 'a.', 'Odd; fantastic; fanciful; grotesque; ludicrous.'),
(3153, 'Antic', 'n.', 'A buffoon or merry-andrew; one that practices odd\n   gesticulations; the Fool of the old play.'),
(3154, 'Antic', 'n.', 'An odd imagery, device, or tracery; a fantastic figure.'),
(3155, 'Antic', 'n.', 'A grotesque trick; a piece of buffoonery; a caper.'),
(3156, 'Antic', 'n.', 'A grotesque representation.'),
(3157, 'Antic', 'n.', 'An antimask.'),
(3158, 'Anticked', 'imp. & p. p.', 'of Antic'),
(3159, 'Antickt', '', 'of Antic'),
(3160, 'Antic', 'v. t.', 'To make appear like a buffoon.'),
(3161, 'Antic', 'v. i.', 'To perform antics.'),
(3162, 'Anticly', 'adv.', 'Oddly; grotesquely.'),
(3163, 'Anticor', 'n.', 'A dangerous inflammatory swelling of a horse\'s breast,\n   just opposite the heart.'),
(3164, 'Anticous', 'a.', 'Facing toward the axis of the flower, as in the introrse\n   anthers of the water lily.'),
(3165, 'Antidote', 'n.', 'A remedy to counteract the effects of poison, or of\n   anything noxious taken into the stomach; -- used with against, for, or\n   to; as, an antidote against, for, or to, poison.'),
(3166, 'Antidote', 'n.', 'Whatever tends to prevent mischievous effects, or to\n   counteract evil which something else might produce.'),
(3167, 'Antidote', 'v. t.', 'To counteract or prevent the effects of, by giving or\n   taking an antidote.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(3168, 'Antidote', 'v. t.', 'To fortify or preserve by an antidote.'),
(3169, 'Antilogy', 'n.', 'A contradiction between any words or passages in an\n   author.'),
(3170, 'Antimask', 'n.', 'A secondary mask, or grotesque interlude, between the\n   parts of a serious mask.'),
(3171, 'Antimere', 'n.', 'One of the two halves of bilaterally symmetrical animals;\n   one of any opposite symmetrical or homotypic parts in animals and\n   plants.'),
(3172, 'Antimony', 'n.', 'An elementary substance, resembling a metal in its\n   appearance and physical properties, but in its chemical relations\n   belonging to the class of nonmetallic substances. Atomic weight, 120.\n   Symbol, Sb.'),
(3173, 'Antinomy', 'n.', 'Opposition of one law or rule to another law or rule.'),
(3174, 'Antinomy', 'n.', 'An opposing law or rule of any kind.'),
(3175, 'Antinomy', 'n.', 'A contradiction or incompatibility of thought or\n   language; -- in the Kantian philosophy, such a contradiction as arises\n   from the attempt to apply to the ideas of the reason, relations or\n   attributes which are appropriate only to the facts or the concepts of\n   experience.'),
(3176, 'Antiphon', 'n.', 'A musical response; alternate singing or chanting. See\n   Antiphony, and Antiphone.'),
(3177, 'Antiphon', 'n.', 'A verse said before and after the psalms.'),
(3178, 'Antipode', 'n.', 'One of the antipodes; anything exactly opposite.'),
(3179, 'Antipole', 'n.', 'The opposite pole; anything diametrically opposed.'),
(3180, 'Antipope', 'n.', 'One who is elected, or claims to be, pope in opposition\n   to the pope canonically chosen; esp. applied to those popes who resided\n   at Avignon during the Great Schism.'),
(3181, 'Antipyic', 'a.', 'Checking or preventing suppuration.'),
(3182, 'Antipyic', 'n.', 'An antipyic medicine.'),
(3183, 'Antique', 'a.', 'Old; ancient; of genuine antiquity; as, an antique statue.\n   In this sense it usually refers to the flourishing ages of Greece and\n   Rome.'),
(3184, 'Antique', 'a.', 'Old, as respects the present age, or a modern period of\n   time; of old fashion; antiquated; as, an antique robe.'),
(3185, 'Antique', 'a.', 'Made in imitation of antiquity; as, the antique style of\n   Thomson\'s \"Castle of Indolence.\"'),
(3186, 'Antique', 'a.', 'Odd; fantastic.'),
(3187, 'Antique', 'a.', 'In general, anything very old; but in a more limited\n   sense, a relic or object of ancient art; collectively, the antique, the\n   remains of ancient art, as busts, statues, paintings, and vases.'),
(3188, 'Antiscii', 'n. pl.', 'The inhabitants of the earth, living on different\n   sides of the equator, whose shadows at noon are cast in opposite\n   directions.'),
(3189, 'Antithet', 'n.', 'An antithetic or contrasted statement.'),
(3190, 'Antitype', 'n.', 'That of which the type is the pattern or representation;\n   that which is represented by the type or symbol.'),
(3191, 'Antitypy', 'n.', 'Opposition or resistance of matter to force.'),
(3192, 'Antler', 'n.', 'The entire horn, or any branch of the horn, of a cervine\n   animal, as of a stag.'),
(3193, 'Antlered', 'a.', 'Furnished with antlers.'),
(3194, 'Antilae', 'pl. ', 'of Antlia'),
(3195, 'Antlia', 'n.', 'The spiral tubular proboscis of lepidopterous insects. See\n   Lepidoptera.'),
(3196, 'Ant-lion', 'n.', 'A neuropterous insect, the larva of which makes in the\n   sand a pitfall to capture ants, etc. The common American species is\n   Myrmeleon obsoletus, the European is M. formicarius.'),
(3197, 'Antoeci', 'n. pl', 'Alt. of Antoecians'),
(3198, 'Antonym', 'n.', 'A word of opposite meaning; a counterterm; -- used as a\n   correlative of synonym.'),
(3199, 'Antozone', 'n.', 'A compound formerly supposed to be modification of\n   oxygen, but now known to be hydrogen dioxide; -- so called because\n   apparently antagonistic to ozone, converting it into ordinary oxygen.'),
(3200, 'Antral', 'a.', 'Relating to an antrum.'),
(3201, 'Antre', 'n.', 'A cavern.'),
(3202, 'Antrorse', 'a.', 'Forward or upward in direction.'),
(3203, 'Antra', 'pl. ', 'of Antrum'),
(3204, 'Antrum', 'n.', 'A cavern or cavity, esp. an anatomical cavity or sinus'),
(3205, 'Anubis', 'n.', 'An Egyptian deity, the conductor of departed spirits,\n   represented by a human figure with the head of a dog or fox.'),
(3206, 'Anura', 'n. pl.', 'One of the orders of amphibians characterized by the\n   absence of a tail, as the frogs and toads.'),
(3207, 'Anurous', 'a.', 'Destitute of a tail, as the frogs and toads.'),
(3208, 'Anury', 'n.', 'Nonsecretion or defective secretion of urine; ischury.'),
(3209, 'Anvil', 'n.', 'An iron block, usually with a steel face, upon which metals\n   are hammered and shaped.'),
(3210, 'Anvil', 'n.', 'Anything resembling an anvil in shape or use.'),
(3211, 'Anvil', 'n.', 'the incus. See Incus.'),
(3212, 'Anvil', 'v. t.', 'To form or shape on an anvil; to hammer out; as, anviled\n   armor.'),
(3213, 'Anxiety', 'n.', 'Concern or solicitude respecting some thing or event,\n   future or uncertain, which disturbs the mind, and keeps it in a state\n   of painful uneasiness.'),
(3214, 'Anxiety', 'n.', 'Eager desire.'),
(3215, 'Anxiety', 'n.', 'A state of restlessness and agitation, often with general\n   indisposition and a distressing sense of oppression at the epigastrium.'),
(3216, 'Anxious', 'a.', 'Full of anxiety or disquietude; greatly concerned or\n   solicitous, esp. respecting something future or unknown; being in\n   painful suspense; -- applied to persons; as, anxious for the issue of a\n   battle.'),
(3217, 'Anxious', 'a.', 'Accompanied with, or causing, anxiety; worrying; --\n   applied to things; as, anxious labor.'),
(3218, 'Anxious', 'a.', 'Earnestly desirous; as, anxious to please.'),
(3219, 'Anybody', 'n.', 'Any one out of an indefinite number of persons; anyone;\n   any person.'),
(3220, 'Anybody', 'n.', 'A person of consideration or standing.'),
(3221, 'Anyhow', 'adv.', 'In any way or manner whatever; at any rate; in any event.'),
(3222, 'Anyone', 'n.', 'One taken at random rather than by selection; anybody.\n   [Commonly written as two words.]'),
(3223, 'Anything', 'n.', 'Any object, act, state, event, or fact whatever; thing of\n   any kind; something or other; aught; as, I would not do it for\n   anything.'),
(3224, 'Anything', 'n.', 'Expressing an indefinite comparison; -- with as or like.'),
(3225, 'Anything', 'adv.', 'In any measure; anywise; at all.'),
(3226, 'Anyway', 'adv.', 'Alt. of Anyways'),
(3227, 'Anyways', 'adv.', 'Anywise; at all.'),
(3228, 'Anywhere', 'adv.', 'In any place.'),
(3229, 'Anywise', 'adv.', 'In any wise or way; at all.'),
(3230, 'Aonian', 'a.', 'Pertaining to Aonia, in B/otia, or to the Muses, who were\n   supposed to dwell there.'),
(3231, 'Aorist', 'n.', 'A tense in the Greek language, which expresses an action as\n   completed in past time, but leaves it, in other respects, wholly\n   indeterminate.'),
(3232, 'Aoristic', 'a.', 'Indefinite; pertaining to the aorist tense.'),
(3233, 'Aorta', 'n.', 'The great artery which carries the blood from the heart to\n   all parts of the body except the lungs; the main trunk of the arterial\n   system.'),
(3234, 'Aortic', 'a.', 'Of or pertaining to the aorta.'),
(3235, 'Aortitis', 'n.', 'Inflammation of the aorta.'),
(3236, 'Aoudad', 'n.', 'An African sheeplike quadruped (the Ammotragus tragelaphus)\n   having a long mane on the breast and fore legs. It is, perhaps, the\n   chamois of the Old Testament.'),
(3237, 'Apace', 'adv.', 'With a quick pace; quick; fast; speedily.'),
(3238, 'Apaches', 'n. pl.', 'A group of nomadic North American Indians including\n   several tribes native of Arizona, New Mexico, etc.'),
(3239, 'Apagoge', 'n.', 'An indirect argument which proves a thing by showing the\n   impossibility or absurdity of the contrary.'),
(3240, 'Apagogic', 'a.', 'Alt. of Apagogical'),
(3241, 'Apaid', 'a.', 'Paid; pleased.'),
(3242, 'Apair', 'v. t. & i.', 'To impair or become impaired; to injure.'),
(3243, 'Apanage', 'n.', 'Same as Appanage.'),
(3244, 'Apara', 'n.', 'See Mataco.'),
(3245, 'Aparejo', 'n.', 'A kind of pack saddle used in the American military\n   service and among the Spanish Americans. It is made of leather stuffed\n   with hay, moss, or the like.'),
(3246, 'Apart', 'adv.', 'Separately, in regard to space or company; in a state of\n   separation as to place; aside.'),
(3247, 'Apart', 'adv.', 'In a state of separation, of exclusion, or of distinction,\n   as to purpose, use, or character, or as a matter of thought;\n   separately; independently; as, consider the two propositions apart.'),
(3248, 'Apart', 'adv.', 'Aside; away.'),
(3249, 'Apart', 'adv.', 'In two or more parts; asunder; to piece; as, to take a\n   piece of machinery apart.'),
(3250, 'Apastron', 'n.', 'That point in the orbit of a double star where the\n   smaller star is farthest from its primary.'),
(3251, 'Apathist', 'n.', 'One who is destitute of feeling.'),
(3252, 'Apathies', 'pl. ', 'of Apathy'),
(3253, 'Apathy', 'n.', 'Want of feeling; privation of passion, emotion, or\n   excitement; dispassion; -- applied either to the body or the mind. As\n   applied to the mind, it is a calmness, indolence, or state of\n   indifference, incapable of being ruffled or roused to active interest\n   or exertion by pleasure, pain, or passion.'),
(3254, 'Apatite', 'n.', 'Native phosphate of lime, occurring usually in six-sided\n   prisms, color often pale green, transparent or translucent.'),
(3255, 'Apaume', 'n.', 'See Appaume.'),
(3256, 'Aping', 'p. pr. & vb. n.', 'of Ape'),
(3257, 'Apeak', 'adv. & a.', 'In a vertical line. The anchor in apeak, when the\n   cable has been sufficiently hove in to bring the ship over it, and the\n   ship is them said to be hove apeak.'),
(3258, 'Apehood', 'n.', 'The state of being an ape.'),
(3259, 'Apellous', 'a.', 'Destitute of skin.'),
(3260, 'Apennine', 'a.', 'Of, pertaining to, or designating, the Apennines, a chain\n   of mountains extending through Italy.'),
(3261, 'Apepsy', 'n.', 'Defective digestion, indigestion.'),
(3262, 'Aperea', 'n.', 'The wild Guinea pig of Brazil (Cavia aperea).'),
(3263, 'Aperient', 'a.', 'Gently opening the bowels; laxative.'),
(3264, 'Aperient', 'n.', 'An aperient medicine or food.'),
(3265, 'Apert', 'a.', 'Open; evident; undisguised.'),
(3266, 'Apert', 'adv.', 'Openly.'),
(3267, 'Apertion', 'n.', 'The act of opening; an opening; an aperture.'),
(3268, 'Apertly', 'adv.', 'Openly; clearly.'),
(3269, 'Aperture', 'n.', 'The act of opening.'),
(3270, 'Aperture', 'n.', 'An opening; an open space; a gap, cleft, or chasm; a\n   passage perforated; a hole; as, an aperture in a wall.'),
(3271, 'Aperture', 'n.', 'The diameter of the exposed part of the object glass of a\n   telescope or other optical instrument; as, a telescope of four-inch\n   aperture.'),
(3272, 'Aperies', 'pl. ', 'of Apery'),
(3273, 'Apery', 'n.', 'A place where apes are kept.'),
(3274, 'Apery', 'n.', 'The practice of aping; an apish action.'),
(3275, 'Apexes', 'pl. ', 'of Apex'),
(3276, 'Apices', 'pl. ', 'of Apex'),
(3277, 'Aphakia', 'n.', 'An anomalous state of refraction caused by the absence of\n   the crystalline lens, as after operations for cataract. The remedy is\n   the use of powerful convex lenses.'),
(3278, 'Aphakial', 'a.', 'Pertaining to aphakia; as, aphakial eyes.'),
(3279, 'Aphanite', 'n.', 'A very compact, dark-colored /ock, consisting of\n   hornblende, or pyroxene, and feldspar, but neither of them in\n   perceptible grains.'),
(3280, 'Aphasia', 'n.', 'Alt. of Aphasy'),
(3281, 'Aphasy', 'n.', 'Loss of the power of speech, or of the appropriate use of\n   words, the vocal organs remaining intact, and the intelligence being\n   preserved. It is dependent on injury or disease of the brain.'),
(3282, 'Aphasic', 'a.', 'Pertaining to, or affected by, aphasia; speechless.'),
(3283, 'Aphelia', 'pl. ', 'of Aphelion'),
(3284, 'Aphelion', 'n.', 'That point of a planet\'s or comet\'s orbit which is most\n   distant from the sun, the opposite point being the perihelion.'),
(3285, 'Aphemia', 'n.', 'Loss of the power of speaking, while retaining the power\n   of writing; -- a disorder of cerebral origin.'),
(3286, 'Aphesis', 'n.', 'The loss of a short unaccented vowel at the beginning of a\n   word; -- the result of a phonetic process; as, squire for esquire.'),
(3287, 'Aphetic', 'a.', 'Shortened by dropping a letter or a syllable from the\n   beginning of a word; as, an aphetic word or form.'),
(3288, 'Aphetism', 'n.', 'An aphetized form of a word.'),
(3289, 'Aphetize', 'v. t.', 'To shorten by aphesis.'),
(3290, 'Aphid', 'n.', 'One of the genus Aphis; an aphidian.'),
(3291, 'Aphides', 'n. pl.', 'See Aphis.'),
(3292, 'Aphidian', 'a.', 'Of or pertaining to the family Aphidae.'),
(3293, 'Aphidian', 'n.', 'One of the aphides; an aphid.'),
(3294, 'Aphides', 'pl. ', 'of Aphis'),
(3295, 'Aphis', 'n.', 'A genus of insects belonging to the order Hemiptera and\n   family Aphidae, including numerous species known as plant lice and\n   green flies.'),
(3296, 'Aphonia', 'n.', 'Alt. of Aphony'),
(3297, 'Aphony', 'n.', 'Loss of voice or vocal utterance.'),
(3298, 'Aphonic', 'a.', 'Alt. of Aphonous'),
(3299, 'Aphonous', 'a.', 'Without voice; voiceless; nonvocal.'),
(3300, 'Aphorism', 'n.', 'A comprehensive maxim or principle expressed in a few\n   words; a sharply defined sentence relating to abstract truth rather\n   than to practical matters.'),
(3301, 'Aphorist', 'n.', 'A writer or utterer of aphorisms.'),
(3302, 'Aphorize', 'v. i.', 'To make aphorisms.'),
(3303, 'Aphrite', 'n.', 'See under Calcite.'),
(3304, 'Aphtha', 'n.', 'One of the whitish specks called aphthae.'),
(3305, 'Aphtha', 'n.', 'The disease, also called thrush.'),
(3306, 'Aphthae', 'n. pl.', 'Roundish pearl-colored specks or flakes in the mouth,\n   on the lips, etc., terminating in white sloughs. They are commonly\n   characteristic of thrush.'),
(3307, 'Aphthoid', 'a.', 'Of the nature of aphthae; resembling thrush.'),
(3308, 'Aphthong', 'n.', 'A letter, or a combination of letters, employed in\n   spelling a word, but in the pronunciation having no sound.'),
(3309, 'Aphthous', 'a.', 'Pertaining to, or caused by, aphthae; characterized by\n   aphtae; as, aphthous ulcers; aphthous fever.'),
(3310, 'Apian', 'a.', 'Belonging to bees.'),
(3311, 'Apiarian', 'a.', 'Of or relating to bees.'),
(3312, 'Apiarist', 'n.', 'One who keeps an apiary.'),
(3313, 'Apiary', 'n.', 'A place where bees are kept; a stand or shed for bees; a\n   beehouse.'),
(3314, 'Apical', 'a.', 'At or belonging to an apex, tip, or summit.'),
(3315, 'Apices', 'n. pl.', 'See Apex.'),
(3316, 'Apician', 'a.', 'Belonging to Apicius, a notorious Roman epicure; hence\n   applied to whatever is peculiarly refined or dainty and expensive in\n   cookery.'),
(3317, 'Apicular', 'a.', 'Situated at, or near, the apex; apical.'),
(3318, 'Apiece', 'adv.', 'Each by itself; by the single one; to each; as the share\n   of each; as, these melons cost a shilling apiece.'),
(3319, 'Apieces', 'adv.', 'In pieces or to pieces.'),
(3320, 'Apiked', 'a.', 'Trimmed.'),
(3321, 'Apiol', 'n.', 'An oily liquid derived from parsley.'),
(3322, 'Apish', 'a.', 'Having the qualities of an ape; prone to imitate in a\n   servile manner. Hence: Apelike; fantastically silly; foppish; affected;\n   trifling.'),
(3323, 'Apishly', 'adv.', 'In an apish manner; with servile imitation; foppishly.'),
(3324, 'Apitpat', 'adv.', 'With quick beating or palpitation; pitapat.'),
(3325, 'Aplastic', 'a.', 'Not plastic or easily molded.'),
(3326, 'Aplomb', 'n.', 'Assurance of manner or of action; self-possession.'),
(3327, 'Aplotomy', 'n.', 'Simple incision.'),
(3328, 'Aplustre', 'n.', 'An ornamental appendage of wood at the ship\'s stern,\n   usually spreading like a fan and curved like a bird\'s feather.'),
(3329, 'Aplysia', 'n.', 'A genus of marine mollusks of the order Tectibranchiata;\n   the sea hare. Some of the species when disturbed throw out a deep\n   purple liquor, which colors the water to some distance. See Illust. in\n   Appendix.'),
(3330, 'Apnoea', 'n.', 'Partial privation or suspension of breath; suffocation.'),
(3331, 'Apocope', 'n.', 'The cutting off, or omission, of the last letter,\n   syllable, or part of a word.'),
(3332, 'Apocope', 'n.', 'A cutting off; abscission.'),
(3333, 'Apocynin', 'n.', 'A bitter principle obtained from the dogbane (Apocynum\n   cannabinum).'),
(3334, 'Apodal', 'n.', 'Without feet; footless.'),
(3335, 'Apodal', 'n.', 'Destitute of the ventral fin, as the eels.'),
(3336, 'Apods', 'pl. ', 'of Apode'),
(3337, 'Apodes', 'pl. ', 'of Apode'),
(3338, 'Apode', 'n.', 'One of certain animals that have no feet or footlike organs;\n   esp. one of certain fabulous birds which were said to have no feet.'),
(3339, 'Apoda', 'n.', 'A group of cirripeds, destitute of footlike organs.'),
(3340, 'Apoda', 'n.', 'An order of Amphibia without feet. See Ophiomorpha.'),
(3341, 'Apoda', 'n.', 'A group of worms without appendages, as the leech.'),
(3342, 'Apodan', 'a.', 'Apodal.'),
(3343, 'Apodeme', 'n.', 'One of the processes of the shell which project inwards\n   and unite with one another, in the thorax of many Crustacea.'),
(3344, 'Apodes', 'n. pl.', 'An order of fishes without ventral fins, including the\n   eels.'),
(3345, 'Apodes', 'n. pl.', 'A group of holothurians destitute of suckers. See\n   Apneumona.'),
(3346, 'Apodixis', 'n.', 'Full demonstration.'),
(3347, 'Apodosis', 'n.', 'The consequent clause or conclusion in a conditional\n   sentence, expressing the result, and thus distinguished from the\n   protasis or clause which expresses a condition. Thus, in the sentence,\n   \"Though he slay me, yet will I trust in him,\" the former clause is the\n   protasis, and the latter the apodosis.'),
(3348, 'Apodous', 'a.', 'Apodal; apod.'),
(3349, 'Apogaic', 'a.', 'Apogean.'),
(3350, 'Apogamic', 'a.', 'Relating to apogamy.'),
(3351, 'Apogamy', 'n.', 'The formation of a bud in place of a fertilized ovule or\n   oospore.'),
(3352, 'Apogeal', 'a.', 'Apogean.'),
(3353, 'Apogean', 'a.', 'Connected with the apogee; as, apogean (neap) tides, which\n   occur when the moon has passed her apogee.'),
(3354, 'Apogee', 'n.', 'That point in the orbit of the moon which is at the\n   greatest distance from the earth.'),
(3355, 'Apogee', 'n.', 'Fig.: The farthest or highest point; culmination.'),
(3356, 'Apograph', 'n.', 'A copy or transcript.'),
(3357, 'Apohyal', 'a.', 'Of or pertaining to a portion of the horn of the hyoid\n   bone.'),
(3358, 'Apoise', 'adv.', 'Balanced.'),
(3359, 'Apolar', 'a.', 'Having no radiating processes; -- applied particularly to\n   certain nerve cells.'),
(3360, 'Apollo', 'n.', 'A deity among the Greeks and Romans. He was the god of\n   light and day (the \"sun god\"), of archery, prophecy, medicine, poetry,\n   and music, etc., and was represented as the model of manly grace and\n   beauty; -- called also Phebus.'),
(3361, 'Apollyon', 'n.', 'The Destroyer; -- a name used (Rev. ix. 11) for the angel\n   of the bottomless pit, answering to the Hebrew Abaddon.'),
(3362, 'Apologer', 'n.', 'A teller of apologues.'),
(3363, 'Apologue', 'n.', 'A story or relation of fictitious events, intended to\n   convey some moral truth; a moral fable.'),
(3364, 'Apology', 'n.', 'Something said or written in defense or justification of\n   what appears to others wrong, or of what may be liable to\n   disapprobation; justification; as, Tertullian\'s Apology for\n   Christianity.'),
(3365, 'Apology', 'n.', 'An acknowledgment intended as an atonement for some\n   improper or injurious remark or act; an admission to another of a wrong\n   or discourtesy done him, accompanied by an expression of regret.'),
(3366, 'Apology', 'n.', 'Anything provided as a substitute; a makeshift.'),
(3367, 'Apology', 'v. i.', 'To offer an apology.'),
(3368, 'Apophyge', 'n.', 'The small hollow curvature given to the top or bottom of\n   the shaft of a column where it expands to meet the edge of the fillet;\n   -- called also the scape.'),
(3369, 'Apoplex', 'n.', 'Apoplexy.'),
(3370, 'Apoplexy', 'n.', 'Sudden diminution or loss of consciousness, sensation,\n   and voluntary motion, usually caused by pressure on the brain.'),
(3371, 'Aporias', 'pl. ', 'of Aporia'),
(3372, 'Aporia', 'n.', 'A figure in which the speaker professes to be at a loss\n   what course to pursue, where to begin to end, what to say, etc.'),
(3373, 'Aporosa', 'n. pl.', 'A group of corals in which the coral is not porous; --\n   opposed to Perforata.'),
(3374, 'Aporose', 'a.', 'Without pores.'),
(3375, 'Aport', 'adv.', 'On or towards the port or left side; -- said of the helm.'),
(3376, 'Apositic', 'a.', 'Destroying the appetite, or suspending hunger.'),
(3377, 'Apostasy', 'n.', 'An abandonment of what one has voluntarily professed; a\n   total desertion of departure from one\'s faith, principles, or party;\n   esp., the renunciation of a religious faith; as, Julian\'s apostasy from\n   Christianity.'),
(3378, 'Apostate', 'n.', 'One who has forsaken the faith, principles, or party, to\n   which he before adhered; esp., one who has forsaken his religion for\n   another; a pervert; a renegade.'),
(3379, 'Apostate', 'n.', 'One who, after having received sacred orders, renounces\n   his clerical profession.'),
(3380, 'Apostate', 'a.', 'Pertaining to, or characterized by, apostasy; faithless\n   to moral allegiance; renegade.'),
(3381, 'Apostate', 'v. i.', 'To apostatize.'),
(3382, 'Aposteme', 'n.', 'An abscess; a swelling filled with purulent matter.'),
(3383, 'Apostil', 'n.', 'Alt. of Apostille'),
(3384, 'Apostle', 'n.', 'Literally: One sent forth; a messenger. Specifically: One\n   of the twelve disciples of Christ, specially chosen as his companions\n   and witnesses, and sent forth to preach the gospel.'),
(3385, 'Apostle', 'n.', 'The missionary who first plants the Christian faith in any\n   part of the world; also, one who initiates any great moral reform, or\n   first advocates any important belief; one who has extraordinary success\n   as a missionary or reformer; as, Dionysius of Corinth is called the\n   apostle of France, John Eliot the apostle to the Indians, Theobald\n   Mathew the apostle of temperance.'),
(3386, 'Apostle', 'n.', 'A brief letter dimissory sent by a court appealed from to\n   the superior court, stating the case, etc.; a paper sent up on appeals\n   in the admiralty courts.'),
(3387, 'Apostume', 'n.', 'See Aposteme.'),
(3388, 'Apothegm', 'n.', 'Alt. of Apophthegm'),
(3389, 'Apothem', 'n.', 'The perpendicular from the center to one of the sides of a\n   regular polygon.'),
(3390, 'Apothem', 'n.', 'A deposit formed in a liquid extract of a vegetable\n   substance by exposure to the air.'),
(3391, 'Apotome', 'n.', 'The difference between two quantities commensurable only\n   in power, as between Ã2 and 1, or between the diagonal and side of a\n   square.'),
(3392, 'Apotome', 'n.', 'The remaining part of a whole tone after a smaller\n   semitone has been deducted from it; a major semitone.'),
(3393, 'Apozem', 'n.', 'A decoction or infusion.'),
(3394, 'Appair', 'v. t. & i.', 'To impair; to grow worse.'),
(3395, 'Appalled', 'imp. & p. p.', 'of Appall'),
(3396, 'Appall', 'a.', 'To make pale; to blanch.'),
(3397, 'Appall', 'a.', 'To weaken; to enfeeble; to reduce; as, an old appalled\n   wight.'),
(3398, 'Appall', 'a.', 'To depress or discourage with fear; to impress with fear in\n   such a manner that the mind shrinks, or loses its firmness; to overcome\n   with sudden terror or horror; to dismay; as, the sight appalled the\n   stoutest heart.'),
(3399, 'Appall', 'v. i.', 'To grow faint; to become weak; to become dismayed or\n   discouraged.'),
(3400, 'Appall', 'v. i.', 'To lose flavor or become stale.'),
(3401, 'Appall', 'n.', 'Terror; dismay.'),
(3402, 'Appanage', 'n.', 'The portion of land assigned by a sovereign prince for\n   the subsistence of his younger sons.'),
(3403, 'Appanage', 'n.', 'A dependency; a dependent territory.'),
(3404, 'Appanage', 'n.', 'That which belongs to one by custom or right; a natural\n   adjunct or accompaniment.'),
(3405, 'Apparel', 'n.', 'External clothing; vesture; garments; dress; garb;\n   external habiliments or array.'),
(3406, 'Apparel', 'n.', 'A small ornamental piece of embroidery worn on albs and\n   some other ecclesiastical vestments.'),
(3407, 'Apparel', 'n.', 'The furniture of a ship, as masts, sails, rigging,\n   anchors, guns, etc.'),
(3408, 'Apparel', 'v. t.', 'To make or get (something) ready; to prepare.'),
(3409, 'Apparel', 'v. t.', 'To furnish with apparatus; to equip; to fit out.'),
(3410, 'Apparel', 'v. t.', 'To dress or clothe; to attire.'),
(3411, 'Apparel', 'v. t.', 'To dress with external ornaments; to cover with\n   something ornamental; to deck; to embellish; as, trees appareled with\n   flowers, or a garden with verdure.'),
(3412, 'Apparent', 'a.', 'Capable of being seen, or easily seen; open to view;\n   visible to the eye; within sight or view.'),
(3413, 'Apparent', 'a.', 'Clear or manifest to the understanding; plain; evident;\n   obvious; known; palpable; indubitable.'),
(3414, 'Apparent', 'a.', 'Appearing to the eye or mind (distinguished from, but not\n   necessarily opposed to, true or real); seeming; as the apparent motion\n   or diameter of the sun.'),
(3415, 'Apparent', 'n.', 'An heir apparent.'),
(3416, 'Appaume', 'n.', 'A hand open and extended so as to show the palm.'),
(3417, 'Appay', 'v. t.', 'To pay; to satisfy or appease.'),
(3418, 'Appeach', 'v. t.', 'To impeach; to accuse; to asperse; to inform against;\n   to reproach.'),
(3419, 'Appealed', 'imp. & p. p.', 'of Appeal'),
(3420, 'Appeal', 'v. t.', 'To make application for the removal of (a cause) from an\n   inferior to a superior judge or court for a rehearing or review on\n   account of alleged injustice or illegality in the trial below. We say,\n   the cause was appealed from an inferior court.'),
(3421, 'Appeal', 'v. t.', 'To charge with a crime; to accuse; to institute a\n   private criminal prosecution against for some heinous crime; as, to\n   appeal a person of felony.'),
(3422, 'Appeal', 'v. t.', 'To summon; to challenge.'),
(3423, 'Appeal', 'v. t.', 'To invoke.'),
(3424, 'Appeal', 'v. t.', 'To apply for the removal of a cause from an inferior to\n   a superior judge or court for the purpose of reexamination of for\n   decision.'),
(3425, 'Appeal', 'v. t.', 'To call upon another to decide a question controverted,\n   to corroborate a statement, to vindicate one\'s rights, etc.; as, I\n   appeal to all mankind for the truth of what is alleged. Hence: To call\n   on one for aid; to make earnest request.'),
(3426, 'Appeal', 'v. t.', 'An application for the removal of a cause or suit from\n   an inferior to a superior judge or court for reexamination or review.'),
(3427, 'Appeal', 'v. t.', 'The mode of proceeding by which such removal is\n   effected.'),
(3428, 'Appeal', 'v. t.', 'The right of appeal.'),
(3429, 'Appeal', 'v. t.', 'An accusation; a process which formerly might be\n   instituted by one private person against another for some heinous crime\n   demanding punishment for the particular injury suffered, rather than\n   for the offense against the public.'),
(3430, 'Appeal', 'v. t.', 'An accusation of a felon at common law by one of his\n   accomplices, which accomplice was then called an approver. See\n   Approvement.'),
(3431, 'Appeal', 'v. t.', 'A summons to answer to a charge.'),
(3432, 'Appeal', 'v. t.', 'A call upon a person or an authority for proof or\n   decision, in one\'s favor; reference to another as witness; a call for\n   help or a favor; entreaty.'),
(3433, 'Appeal', 'v. t.', 'Resort to physical means; recourse.'),
(3434, 'Appealer', 'n.', 'One who makes an appeal.'),
(3435, 'Appeared', 'imp. & p. p.', 'of Appear'),
(3436, 'Appear', 'v. i.', 'To come or be in sight; to be in view; to become\n   visible.'),
(3437, 'Appear', 'v. i.', 'To come before the public; as, a great writer appeared\n   at that time.'),
(3438, 'Appear', 'v. i.', 'To stand in presence of some authority, tribunal, or\n   superior person, to answer a charge, plead a cause, or the like; to\n   present one\'s self as a party or advocate before a court, or as a\n   person to be tried.'),
(3439, 'Appear', 'v. i.', 'To become visible to the apprehension of the mind; to be\n   known as a subject of observation or comprehension, or as a thing\n   proved; to be obvious or manifest.'),
(3440, 'Appear', 'v. i.', 'To seem; to have a certain semblance; to look.'),
(3441, 'Appear', 'n.', 'Appearance.'),
(3442, 'Appearer', 'n.', 'One who appears.'),
(3443, 'Appealed', 'imp. & p. p.', 'of Appease'),
(3444, 'Appease', 'v. t.', 'To make quiet; to calm; to reduce to a state of peace;\n   to still; to pacify; to dispel (anger or hatred); as, to appease the\n   tumult of the ocean, or of the passions; to appease hunger or thirst.'),
(3445, 'Appeaser', 'n.', 'One who appeases; a pacifier.'),
(3446, 'Appellee', 'n.', 'The defendant in an appeal; -- opposed to appellant.'),
(3447, 'Appellee', 'n.', 'The person who is appealed against, or accused of crime;\n   -- opposed to appellor.'),
(3448, 'Appellor', 'n.', 'The person who institutes an appeal, or prosecutes\n   another for a crime.'),
(3449, 'Appellor', 'n.', 'One who confesses a felony committed and accuses his\n   accomplices.'),
(3450, 'Appenage', 'n.', 'See Appanage.'),
(3451, 'Appended', 'imp. & p. p.', 'of Append'),
(3452, 'Append', 'v. t.', 'To hang or attach to, as by a string, so that the thing\n   is suspended; as, a seal appended to a record; the inscription was\n   appended to the column.'),
(3453, 'Append', 'v. t.', 'To add, as an accessory to the principal thing; to\n   annex; as, notes appended to this chapter.'),
(3454, 'Appendix', 'n.', 'Something appended or added; an appendage, adjunct, or\n   concomitant.'),
(3455, 'Appendix', 'n.', 'Any literary matter added to a book, but not necessarily\n   essential to its completeness, and thus distinguished from supplement,\n   which is intended to supply deficiencies and correct inaccuracies.'),
(3456, 'Apperil', 'n.', 'Peril.'),
(3457, 'Appete', 'v. t.', 'To seek for; to desire.'),
(3458, 'Appetent', 'a.', 'Desiring; eagerly desirous.'),
(3459, 'Appetite', 'n.', 'The desire for some personal gratification, either of the\n   body or of the mind.'),
(3460, 'Appetite', 'n.', 'Desire for, or relish of, food or drink; hunger.'),
(3461, 'Appetite', 'n.', 'Any strong desire; an eagerness or longing.'),
(3462, 'Appetite', 'n.', 'Tendency; appetency.'),
(3463, 'Appetite', 'n.', 'The thing desired.'),
(3464, 'Appetize', 'v. t.', 'To make hungry; to whet the appetite of.'),
(3465, 'Appian', 'a.', 'Of or pertaining to Appius.'),
(3466, 'Applaud', 'v. t.', 'To show approval of by clapping the hands, acclamation,\n   or other significant sign.'),
(3467, 'Applaud', 'v. t.', 'To praise by words; to express approbation of; to\n   commend; to approve.'),
(3468, 'Applaud', 'v. i.', 'To express approbation loudly or significantly.'),
(3469, 'Applause', 'n.', 'The act of applauding; approbation and praise publicly\n   expressed by clapping the hands, stamping or tapping with the feet,\n   acclamation, huzzas, or other means; marked commendation.'),
(3470, 'Apple', 'n.', 'The fleshy pome or fruit of a rosaceous tree (Pyrus malus)\n   cultivated in numberless varieties in the temperate zones.'),
(3471, 'Apple', 'n.', 'Any tree genus Pyrus which has the stalk sunken into the\n   base of the fruit; an apple tree.'),
(3472, 'Apple', 'n.', 'Any fruit or other vegetable production resembling, or\n   supposed to resemble, the apple; as, apple of love, or love apple (a\n   tomato), balsam apple, egg apple, oak apple.'),
(3473, 'Apple', 'n.', 'Anything round like an apple; as, an apple of gold.'),
(3474, 'Apple', 'v. i.', 'To grow like an apple; to bear apples.'),
(3475, 'Applier', 'n.', 'He who, or that which, applies.'),
(3476, 'Applique', 'a.', 'Ornamented with a pattern (which has been cut out of\n   another color or stuff) applied or transferred to a foundation; as,\n   applique lace; applique work.'),
(3477, 'Applot', 'v. t.', 'To divide into plots or parts; to apportion.'),
(3478, 'Applied', 'imp. & p. p.', 'of Apply'),
(3479, 'Applying', 'p. pr. & vb. n.', 'of Apply'),
(3480, 'Apply', 'v. t.', 'To lay or place; to put or adjust (one thing to another);\n   -- with to; as, to apply the hand to the breast; to apply medicaments\n   to a diseased part of the body.'),
(3481, 'Apply', 'v. t.', 'To put to use; to use or employ for a particular purpose,\n   or in a particular case; to appropriate; to devote; as, to apply money\n   to the payment of a debt.'),
(3482, 'Apply', 'v. t.', 'To make use of, declare, or pronounce, as suitable,\n   fitting, or relative; as, to apply the testimony to the case; to apply\n   an epithet to a person.'),
(3483, 'Apply', 'v. t.', 'To fix closely; to engage and employ diligently, or with\n   attention; to attach; to incline.'),
(3484, 'Apply', 'v. t.', 'To direct or address.'),
(3485, 'Apply', 'v. t.', 'To betake; to address; to refer; -- used reflexively.'),
(3486, 'Apply', 'v. t.', 'To busy; to keep at work; to ply.'),
(3487, 'Apply', 'v. t.', 'To visit.'),
(3488, 'Apply', 'v. i.', 'To suit; to agree; to have some connection, agreement, or\n   analogy; as, this argument applies well to the case.'),
(3489, 'Apply', 'v. i.', 'To make request; to have recourse with a view to gain\n   something; to make application. (to); to solicit; as, to apply to a\n   friend for information.'),
(3490, 'Apply', 'v. i.', 'To ply; to move.'),
(3491, 'Apply', 'v. i.', 'To apply or address one\'s self; to give application; to\n   attend closely (to).'),
(3492, 'Appoint', 'v. t.', 'To fix with power or firmness; to establish; to mark\n   out.'),
(3493, 'Appoint', 'v. t.', 'To fix by a decree, order, command, resolve, decision,\n   or mutual agreement; to constitute; to ordain; to prescribe; to fix the\n   time and place of.'),
(3494, 'Appoint', 'v. t.', 'To assign, designate, or set apart by authority.'),
(3495, 'Appoint', 'v. t.', 'To furnish in all points; to provide with everything\n   necessary by way of equipment; to equip; to fit out.'),
(3496, 'Appoint', 'v. t.', 'To point at by way, or for the purpose, of censure or\n   commendation; to arraign.'),
(3497, 'Appoint', 'v. t.', 'To direct, designate, or limit; to make or direct a new\n   disposition of, by virtue of a power contained in a conveyance; -- said\n   of an estate already conveyed.'),
(3498, 'Appoint', 'v. i.', 'To ordain; to determine; to arrange.'),
(3499, 'Apporter', 'n.', 'A bringer in; an importer.'),
(3500, 'Appose', 'v. t.', 'To place opposite or before; to put or apply (one thing\n   to another).'),
(3501, 'Appose', 'v. t.', 'To place in juxtaposition or proximity.'),
(3502, 'Appose', 'v. t.', 'To put questions to; to examine; to try. [Obs.] See\n   Pose.'),
(3503, 'Apposed', 'a.', 'Placed in apposition; mutually fitting, as the mandibles\n   of a bird\'s beak.'),
(3504, 'Apposer', 'n.', 'An examiner; one whose business is to put questions.\n   Formerly, in the English Court of Exchequer, an officer who audited the\n   sheriffs\' accounts.'),
(3505, 'Apposite', 'a.', 'Very applicable; well adapted; suitable or fit; relevant;\n   pat; -- followed by to; as, this argument is very apposite to the case.'),
(3506, 'Appraise', 'v. t.', 'To set a value; to estimate the worth of, particularly\n   by persons appointed for the purpose; as, to appraise goods and\n   chattels.'),
(3507, 'Appraise', 'v. t.', 'To estimate; to conjecture.'),
(3508, 'Appraise', 'v. t.', 'To praise; to commend.'),
(3509, 'Apprest', 'a.', 'Pressed close to, or lying against, something for its\n   whole length, as against a stem,'),
(3510, 'Apprised', 'imp. & p. p.', 'of Apprise'),
(3511, 'Apprise', 'v. t.', 'To give notice, verbal or written; to inform; --\n   followed by of; as, we will apprise the general of an intended attack;\n   he apprised the commander of what he had done.'),
(3512, 'Apprise', 'n.', 'Notice; information.'),
(3513, 'Apprizal', 'n.', 'See Appraisal.'),
(3514, 'Apprize', 'v. t.', 'To appraise; to value; to appreciate.'),
(3515, 'Apprizer', 'n.', 'An appraiser.'),
(3516, 'Apprizer', 'n.', 'A creditor for whom an appraisal is made.'),
(3517, 'Approach', 'v. i.', 'To come or go near, in place or time; to draw nigh; to\n   advance nearer.'),
(3518, 'Approach', 'v. i.', 'To draw near, in a figurative sense; to make advances;\n   to approximate; as, he approaches to the character of the ablest\n   statesman.'),
(3519, 'Approach', 'v. t.', 'To bring near; to cause to draw near; to advance.'),
(3520, 'Approach', 'v. t.', 'To come near to in place, time, or character; to draw\n   nearer to; as, to approach the city; to approach my cabin; he\n   approached the age of manhood.'),
(3521, 'Approach', 'v. t.', 'To take approaches to.'),
(3522, 'Approach', 'v. i.', 'The act of drawing near; a coming or advancing near.'),
(3523, 'Approach', 'v. i.', 'A access, or opportunity of drawing near.'),
(3524, 'Approach', 'v. i.', 'Movements to gain favor; advances.'),
(3525, 'Approach', 'v. i.', 'A way, passage, or avenue by which a place or\n   buildings can be approached; an access.'),
(3526, 'Approach', 'v. i.', 'The advanced works, trenches, or covered roads made by\n   besiegers in their advances toward a fortress or military post.'),
(3527, 'Approach', 'v. i.', 'See Approaching.'),
(3528, 'Appromt', 'v. t.', 'To quicken; to prompt.'),
(3529, 'Approof', 'n.', 'Trial; proof.'),
(3530, 'Approof', 'n.', 'Approval; commendation.'),
(3531, 'Appropre', 'v. t.', 'To appropriate.'),
(3532, 'Approval', 'n.', 'Approbation; sanction.'),
(3533, 'Approved', 'imp. & p. p.', 'of Approve'),
(3534, 'Approve', 'v. t.', 'To show to be real or true; to prove.'),
(3535, 'Approve', 'v. t.', 'To make proof of; to demonstrate; to prove or show\n   practically.'),
(3536, 'Approve', 'v. t.', 'To sanction officially; to ratify; to confirm; as, to\n   approve the decision of a court-martial.'),
(3537, 'Approve', 'v. t.', 'To regard as good; to commend; to be pleased with; to\n   think well of; as, we approve the measured of the administration.'),
(3538, 'Approve', 'v. t.', 'To make or show to be worthy of approbation or\n   acceptance.'),
(3539, 'Approve', 'v. t.', 'To make profit of; to convert to one\'s own profit; --\n   said esp. of waste or common land appropriated by the lord of the\n   manor.'),
(3540, 'Approver', 'n.', 'One who approves. Formerly, one who made proof or trial.'),
(3541, 'Approver', 'n.', 'An informer; an accuser.'),
(3542, 'Approver', 'n.', 'One who confesses a crime and accuses another. See 1st\n   Approvement, 2.'),
(3543, 'Approver', 'v. t.', 'A bailiff or steward; an agent.'),
(3544, 'Appui', 'n.', 'A support or supporter; a stay; a prop.'),
(3545, 'Appulse', 'n.', 'A driving or running towards; approach; impulse; also, the\n   act of striking against.'),
(3546, 'Appulse', 'n.', 'The near approach of one heavenly body to another, or to\n   the meridian; a coming into conjunction; as, the appulse of the moon to\n   a star, or of a star to the meridian.'),
(3547, 'Apricate', 'v. t. & i.', 'To bask in the sun.'),
(3548, 'Apricot', 'n.', 'A fruit allied to the plum, of an orange color, oval\n   shape, and delicious taste; also, the tree (Prunus Armeniaca of\n   Linnaeus) which bears this fruit. By cultivation it has been introduced\n   throughout the temperate zone.'),
(3549, 'April', 'n.', 'The fourth month of the year.'),
(3550, 'April', 'n.', 'Fig.: With reference to April being the month in which\n   vegetation begins to put forth, the variableness of its weather, etc.'),
(3551, 'A priori', '', 'Characterizing that kind of reasoning which deduces\n   consequences from definitions formed, or principles assumed, or which\n   infers effects from causes previously known; deductive or deductively.\n   The reverse of a posteriori.'),
(3552, 'A priori', '', 'Applied to knowledge and conceptions assumed, or\n   presupposed, as prior to experience, in order to make experience\n   rational or possible.'),
(3553, 'Aprocta', 'n. pl.', 'A group of Turbellaria in which there is no anal\n   aperture.'),
(3554, 'Apron', 'n.', 'An article of dress, of cloth, leather, or other stuff, worn\n   on the fore part of the body, to keep the clothes clean, to defend them\n   from injury, or as a covering. It is commonly tied at the waist by\n   strings.'),
(3555, 'Apron', 'n.', 'Something which by its shape or use suggests an apron;'),
(3556, 'Apron', 'n.', 'The fat skin covering the belly of a goose or duck.'),
(3557, 'Apron', 'n.', 'A piece of leather, or other material, to be spread before a\n   person riding on an outside seat of a vehicle, to defend him from the\n   rain, snow, or dust; a boot.'),
(3558, 'Apron', 'n.', 'A leaden plate that covers the vent of a cannon.'),
(3559, 'Apron', 'n.', 'A piece of carved timber, just above the foremost end of the\n   keel.'),
(3560, 'Apron', 'n.', 'A platform, or flooring of plank, at the entrance of a dock,\n   against which the dock gates are shut.'),
(3561, 'Apron', 'n.', 'A flooring of plank before a dam to cause the water to make\n   a gradual descent.'),
(3562, 'Apron', 'n.', 'The piece that holds the cutting tool of a planer.'),
(3563, 'Apron', 'n.', 'A strip of lead which leads the drip of a wall into a\n   gutter; a flashing.'),
(3564, 'Apron', 'n.', 'The infolded abdomen of a crab.'),
(3565, 'Aproned', 'a.', 'Wearing an apron.'),
(3566, 'Apronful', 'n.', 'The quantity an apron can hold.'),
(3567, 'Aprosos', 'a. & adv.', 'Opportunely or opportune; seasonably or seasonable.'),
(3568, 'Aprosos', 'a. & adv.', 'By the way; to the purpose; suitably to the place\n   or subject; -- a word used to introduce an incidental observation,\n   suited to the occasion, though not strictly belonging to the narration.'),
(3569, 'Apsidal', 'a.', 'Of or pertaining to the apsides of an orbit.'),
(3570, 'Apsidal', 'a.', 'Of or pertaining to the apse of a church; as, the apsidal\n   termination of the chancel.'),
(3571, 'Apsides', 'n. pl.', 'See Apsis.'),
(3572, 'Apsides', 'pl. ', 'of Apsis'),
(3573, 'Apsis', 'n.', 'One of the two points of an orbit, as of a planet or\n   satellite, which are at the greatest and least distance from the\n   central body, corresponding to the aphelion and perihelion of a planet,\n   or to the apogee and perigee of the moon. The more distant is called\n   the higher apsis; the other, the lower apsis; and the line joining\n   them, the line of apsides.'),
(3574, 'Apsis', 'n.', 'In a curve referred to polar coordinates, any point for\n   which the radius vector is a maximum or minimum.'),
(3575, 'Apsis', 'n.', 'Same as Apse.'),
(3576, 'Aptable', 'a.', 'Capable of being adapted.'),
(3577, 'Aptate', 'v. t.', 'To make fit.'),
(3578, 'Aptera', 'n. pl.', 'Insects without wings, constituting the seventh Linnaen\n   order of insects, an artificial group, which included Crustacea,\n   spiders, centipeds, and even worms. These animals are now placed in\n   several distinct classes and orders.'),
(3579, 'Apteral', 'a.', 'Apterous.'),
(3580, 'Apteral', 'a.', 'Without lateral columns; -- applied to buildings which\n   have no series of columns along their sides, but are either prostyle or\n   amphiprostyle, and opposed to peripteral.'),
(3581, 'Apteran', 'n.', 'One of the Aptera.'),
(3582, 'Apteria', 'n. pl.', 'Naked spaces between the feathered areas of birds. See\n   Pteryliae.'),
(3583, 'Apterous', 'a.', 'Destitute of wings; apteral; as, apterous insects.'),
(3584, 'Apterous', 'a.', 'Destitute of winglike membranous expansions, as a stem or\n   petiole; -- opposed to alate.'),
(3585, 'Apteryx', 'n.', 'A genus of New Zealand birds about the size of a hen, with\n   only short rudiments of wings, armed with a claw and without a tail;\n   the kiwi. It is allied to the gigantic extinct moas of the same\n   country. Five species are known.'),
(3586, 'Aptitude', 'n.', 'A natural or acquired disposition or capacity for a\n   particular purpose, or tendency to a particular action or effect; as,\n   oil has an aptitude to burn.'),
(3587, 'Aptitude', 'n.', 'A general fitness or suitableness; adaptation.'),
(3588, 'Aptitude', 'n.', 'Readiness in learning; docility; aptness.'),
(3589, 'Aptly', 'adv.', 'In an apt or suitable manner; fitly; properly;\n   pertinently; appropriately; readily.'),
(3590, 'Aptness', 'n.', 'Fitness; suitableness; appropriateness; as, the aptness of\n   things to their end.'),
(3591, 'Aptness', 'n.', 'Disposition of the mind; propensity; as, the aptness of\n   men to follow example.'),
(3592, 'Aptness', 'n.', 'Quickness of apprehension; readiness in learning;\n   docility; as, an aptness to learn is more observable in some children\n   than in others.'),
(3593, 'Aptness', 'n.', 'Proneness; tendency; as, the aptness of iron to rust.'),
(3594, 'Aptote', 'n.', 'A noun which has no distinction of cases; an indeclinable\n   noun.'),
(3595, 'Aptotic', 'a.', 'Pertaining to, or characterized by, aptotes; uninflected;\n   as, aptotic languages.'),
(3596, 'Aptychus', 'n.', 'A shelly plate found in the terminal chambers of ammonite\n   shells. Some authors consider them to be jaws; others, opercula.'),
(3597, 'Apyretic', 'a.', 'Without fever; -- applied to days when there is an\n   intermission of fever.'),
(3598, 'Apyrexia', 'n.', 'Alt. of Apyrexy'),
(3599, 'Apyrexy', 'n.', 'The absence or intermission of fever.'),
(3600, 'Apyrous', 'a.', 'Incombustible; capable of sustaining a strong heat without\n   alteration of form or properties.'),
(3601, 'Aquarial', 'a.', 'Alt. of Aquarian'),
(3602, 'Aquarian', 'a.', 'Of or pertaining to an aquarium.'),
(3603, 'Aquarian', 'n.', 'One of a sect of Christian in the primitive church who\n   used water instead of wine in the Lord\'s Supper.'),
(3604, 'Aquaria', 'pl. ', 'of Aquarium'),
(3605, 'Aquarium', 'n.', 'An artificial pond, or a globe or tank (usually with\n   glass sides), in which living specimens of aquatic animals or plants\n   are kept.'),
(3606, 'Aquarius', 'n.', 'The Water-bearer; the eleventh sign in the zodiac, which\n   the sun enters about the 20th of January; -- so called from the rains\n   which prevail at that season in Italy and the East.'),
(3607, 'Aquarius', 'n.', 'A constellation south of Pegasus.'),
(3608, 'Aquatic', 'a.', 'Pertaining to water; growing in water; living in, swimming\n   in, or frequenting the margins of waters; as, aquatic plants and fowls.'),
(3609, 'Aquatic', 'n.', 'An aquatic animal or plant.'),
(3610, 'Aquatic', 'n.', 'Sports or exercises practiced in or on the water.'),
(3611, 'Aquatile', 'a.', 'Inhabiting the water.'),
(3612, 'Aquatint', 'n.', 'Alt. of Aquatinta'),
(3613, 'Aqueduct', 'n.', 'A conductor, conduit, or artificial channel for conveying\n   water, especially one for supplying large cities with water.'),
(3614, 'Aqueduct', 'n.', 'A canal or passage; as, the aqueduct of Sylvius, a\n   channel connecting the third and fourth ventricles of the brain.'),
(3615, 'Aqueity', 'n.', 'Wateriness.'),
(3616, 'Aqueous', 'a.', 'Partaking of the nature of water, or abounding with it;\n   watery.'),
(3617, 'Aqueous', 'a.', 'Made from, or by means of, water.'),
(3618, 'Aquiform', 'a.', 'Having the form of water.'),
(3619, 'Aquilae', 'pl. ', 'of Aquila'),
(3620, 'Aquila', 'n.', 'A genus of eagles.'),
(3621, 'Aquila', 'n.', 'A northern constellation southerly from Lyra and Cygnus and\n   preceding the Dolphin; the Eagle.'),
(3622, 'Aquiline', 'a.', 'Belonging to or like an eagle.'),
(3623, 'Aquiline', 'a.', 'Curving; hooked; prominent, like the beak of an eagle; --\n   applied particularly to the nose'),
(3624, 'Aquilon', 'n.', 'The north wind.'),
(3625, 'Aquose', 'a.', 'Watery; aqueous.'),
(3626, 'Aquosity', 'n.', 'The condition of being wet or watery; wateriness.'),
(3627, 'Arabian', 'a.', 'Of or pertaining to Arabia or its inhabitants.'),
(3628, 'Arabian', 'n.', 'A native of Arabia; an Arab.'),
(3629, 'Arabic', 'a.', 'Of or pertaining to Arabia or the Arabians.'),
(3630, 'Arabic', 'n.', 'The language of the Arabians.'),
(3631, 'Arabical', 'a.', 'Relating to Arabia; Arabic.'),
(3632, 'Arabin', 'n.', 'A carbohydrate, isomeric with cane sugar, contained in gum\n   arabic, from which it is extracted as a white, amorphous substance.'),
(3633, 'Arabin', 'n.', 'Mucilage, especially that made of gum arabic.'),
(3634, 'Arabism', 'n.', 'An Arabic idiom peculiarly of language.'),
(3635, 'Arabist', 'n.', 'One well versed in the Arabic language or literature;\n   also, formerly, one who followed the Arabic system of surgery.'),
(3636, 'Arable', 'a.', 'Fit for plowing or tillage; -- hence, often applied to land\n   which has been plowed or tilled.'),
(3637, 'Arable', 'n.', 'Arable land; plow land.'),
(3638, 'Araby', 'n.', 'The country of Arabia.'),
(3639, 'Aracari', 'n.', 'A South American bird, of the genus Pleroglossius, allied\n   to the toucans. There are several species.'),
(3640, 'Arace', 'v. t.', 'To tear up by the roots; to draw away.'),
(3641, 'Araceous', 'a.', 'Of or pertaining to an order of plants, of which the\n   genus Arum is the type.'),
(3642, 'Arachnid', 'n.', 'An arachnidan.'),
(3643, 'Araguato', 'n.', 'A South American monkey, the ursine howler (Mycetes\n   ursinus). See Howler, n., 2.'),
(3644, 'Araise', 'v. t.', 'To raise.'),
(3645, 'Aramaean', 'a.', 'Alt. of Aramean'),
(3646, 'Aramean', 'a.', 'Of or pertaining to the Syrians and Chaldeans, or to their\n   language; Aramaic.'),
(3647, 'Aramean', 'n.', 'A native of Aram.'),
(3648, 'Aramaic', 'a.', 'Pertaining to Aram, or to the territory, inhabitants,\n   language, or literature of Syria and Mesopotamia; Aramaean; --\n   specifically applied to the northern branch of the Semitic family of\n   languages, including Syriac and Chaldee.'),
(3649, 'Aramaic', 'n.', 'The Aramaic language.'),
(3650, 'Aramaism', 'n.', 'An idiom of the Aramaic.'),
(3651, 'Araneida', 'n. pl.', 'Alt. of Araneoidea'),
(3652, 'Araneina', 'n. pl.', 'The order of Arachnida that includes the spiders.'),
(3653, 'Araneose', 'a.', 'Of the aspect of a spider\'s web; arachnoid.'),
(3654, 'Araneous', 'a.', 'Cobweblike; extremely thin and delicate, like a cobweb;\n   as, the araneous membrane of the eye. See Arachnoid.'),
(3655, 'Arangoes', 'pl. ', 'of Arango'),
(3656, 'Arango', 'n.', 'A bead of rough carnelian. Arangoes were formerly imported\n   from Bombay for use in the African slave trade.'),
(3657, 'Arapaima', 'n.', 'A large fresh-water food fish of South America.'),
(3658, 'Arara', 'n.', 'The palm (or great black) cockatoo, of Australia\n   (Microglossus aterrimus).'),
(3659, 'Aration', 'n.', 'Plowing; tillage.'),
(3660, 'Aratory', 'a.', 'Contributing to tillage.'),
(3661, 'Arbalest', 'n.', 'Alt. of Arbalist');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(3662, 'Arbalist', 'n.', 'A crossbow, consisting of a steel bow set in a shaft of\n   wood, furnished with a string and a trigger, and a mechanical device\n   for bending the bow. It served to throw arrows, darts, bullets, etc.'),
(3663, 'Arbiter', 'n.', 'A person appointed, or chosen, by parties to determine a\n   controversy between them.'),
(3664, 'Arbiter', 'n.', 'Any person who has the power of judging and determining,\n   or ordaining, without control; one whose power of deciding and\n   governing is not limited.'),
(3665, 'Arbiter', 'v. t.', 'To act as arbiter between.'),
(3666, 'Arbitral', 'a.', 'Of or relating to an arbiter or an arbitration.'),
(3667, 'Arblast', 'n.', 'A crossbow. See Arbalest.'),
(3668, 'Arbor', 'n.', 'A kind of latticework formed of, or covered with, vines,\n   branches of trees, or other plants, for shade; a bower.'),
(3669, 'Arbor', 'n.', 'A tree, as distinguished from a shrub.'),
(3670, 'Arbor', 'n.', 'An axle or spindle of a wheel or opinion.'),
(3671, 'Arbor', 'n.', 'A mandrel in lathe turning.'),
(3672, 'Arborary', 'a.', 'Of or pertaining to trees; arboreal.'),
(3673, 'Arboreal', 'a.', 'Of or pertaining to a tree, or to trees; of nature of\n   trees.'),
(3674, 'Arboreal', 'a.', 'Attached to, found in or upon, or frequenting, woods or\n   trees; as, arboreal animals.'),
(3675, 'Arbored', 'a.', 'Furnished with an arbor; lined with trees.'),
(3676, 'Arboret', 'n.', 'A small tree or shrub.'),
(3677, 'Arboreta', 'pl. ', 'of Arboretum'),
(3678, 'Arborist', 'n.', 'One who makes trees his study, or who is versed in the\n   knowledge of trees.'),
(3679, 'Arborous', 'a.', 'Formed by trees.'),
(3680, 'Arbuscle', 'n.', 'A dwarf tree, one in size between a shrub and a tree; a\n   treelike shrub.'),
(3681, 'Arbutus', 'n.', 'Alt. of Arbute'),
(3682, 'Arbute', 'n.', 'The strawberry tree, a genus of evergreen shrubs, of the\n   Heath family. It has a berry externally resembling the strawberry; the\n   arbute tree.'),
(3683, 'Arcade', 'n.', 'A series of arches with the columns or piers which support\n   them, the spandrels above, and other necessary appurtenances; sometimes\n   open, serving as an entrance or to give light; sometimes closed at the\n   back (as in the cut) and forming a decorative feature.'),
(3684, 'Arcade', 'n.', 'A long, arched building or gallery.'),
(3685, 'Arcade', 'n.', 'An arched or covered passageway or avenue.'),
(3686, 'Arcaded', 'a.', 'Furnished with an arcade.'),
(3687, 'Arcadia', 'n.', 'A mountainous and picturesque district of Greece, in the\n   heart of the Peloponnesus, whose people were distinguished for\n   contentment and rural happiness.'),
(3688, 'Arcadia', 'n.', 'Fig.: Any region or scene of simple pleasure and\n   untroubled quiet.'),
(3689, 'Arcadian', 'a.', 'Alt. of Arcadic'),
(3690, 'Arcadic', 'a.', 'Of or pertaining to Arcadia; pastoral; ideally rural; as,\n   Arcadian simplicity or scenery.'),
(3691, 'Arcane', 'a.', 'Hidden; secret.'),
(3692, 'Arcana', 'pl. ', 'of Arcanum'),
(3693, 'Arcanum', 'n.', 'A secret; a mystery; -- generally used in the plural.'),
(3694, 'Arcanum', 'n.', 'A secret remedy; an elixir.'),
(3695, 'Arched', 'imp. & p. p.', 'of Arch'),
(3696, 'Arching', 'p. pr. & vb. n.', 'of Arch'),
(3697, 'Arch-', '', 'A prefix signifying chief, as in archbuilder, archfiend.'),
(3698, '-arch', 'a.', 'A suffix meaning a ruler, as in monarch (a sole ruler).'),
(3699, 'Archaean', 'a.', 'Ancient; pertaining to the earliest period in geological\n   history.'),
(3700, 'Archaean', 'n.', 'The earliest period in geological period, extending up to\n   the Lower Silurian. It includes an Azoic age, previous to the\n   appearance of life, and an Eozoic age, including the earliest forms of\n   life.'),
(3701, 'Archaic', 'a.', 'Of or characterized by antiquity or archaism; antiquated;\n   obsolescent.'),
(3702, 'Archaism', 'a.', 'An ancient, antiquated, or old-fashioned, word,\n   expression, or idiom; a word or form of speech no longer in common use.'),
(3703, 'Archaism', 'a.', 'Antiquity of style or use; obsoleteness.'),
(3704, 'Archaist', 'n.', 'Am antiquary.'),
(3705, 'Archaist', 'n.', 'One who uses archaisms.'),
(3706, 'Archaize', 'v. t.', 'To make appear archaic or antique.'),
(3707, 'Archduke', 'n.', 'A prince of the imperial family of Austria.'),
(3708, 'Arched', 'a.', 'Made with an arch or curve; covered with an arch; as, an\n   arched door.'),
(3709, 'Archer', 'n.', 'A bowman, one skilled in the use of the bow and arrow.'),
(3710, 'Archery', 'n.', 'The use of the bow and arrows in battle, hunting, etc.;\n   the art, practice, or skill of shooting with a bow and arrows.'),
(3711, 'Archery', 'n.', 'Archers, or bowmen, collectively.'),
(3712, 'Arches', '', 'pl. of Arch, n.'),
(3713, 'Archeus', 'n.', 'The vital principle or force which (according to the\n   Paracelsians) presides over the growth and continuation of living\n   beings; the anima mundi or plastic power of the old philosophers.'),
(3714, 'Archi-', '', 'A prefix signifying chief, arch; as, architect,\n   archiepiscopal. In Biol. and Anat. it usually means primitive,\n   original, ancestral; as, archipterygium, the primitive fin or wing.'),
(3715, 'Archical', 'pref.', 'Chief; primary; primordial.'),
(3716, 'Archil', 'n.', 'A violet dye obtained from several species of lichen\n   (Roccella tinctoria, etc.), which grow on maritime rocks in the Canary\n   and Cape Verd Islands, etc.'),
(3717, 'Archil', 'n.', 'The plant from which the dye is obtained.'),
(3718, 'Arching', 'n.', 'The arched part of a structure.'),
(3719, 'Arching', 'n.', 'Hogging; -- opposed to sagging.'),
(3720, '-goes', 'pl. ', 'of Archipelago'),
(3721, 'Archival', 'a.', 'Pertaining to, or contained in, archives or records.'),
(3722, 'Archives', 'pl. ', 'of Archive'),
(3723, 'Archive', 'n.', 'The place in which public records or historic documents\n   are kept.'),
(3724, 'Archive', 'n.', 'Public records or documents preserved as evidence of\n   facts; as, the archives of a country or family.'),
(3725, 'Archlute', 'n.', 'Alt. of Archilute'),
(3726, 'Archly', 'adv.', 'In an arch manner; with attractive slyness or\n   roguishness; slyly; waggishly.'),
(3727, 'Archness', 'n.', 'The quality of being arch; cleverness; sly humor free\n   from malice; waggishness.'),
(3728, 'Archon', 'n.', 'One of the chief magistrates in ancient Athens, especially,\n   by preeminence, the first of the nine chief magistrates.'),
(3729, 'Archonts', 'p. pr.', 'The group including man alone.'),
(3730, 'Archway', 'n.', 'A way or passage under an arch.'),
(3731, 'Archwife', 'n.', 'A big, masculine wife.'),
(3732, 'Archwise', 'adv.', 'Arch-shaped.'),
(3733, 'Archy', 'a.', 'Arched; as, archy brows.'),
(3734, 'archy', '', 'A suffix properly meaning a rule, ruling, as in monarchy, the\n   rule of one only. Cf. -arch.'),
(3735, 'Arciform', 'a.', 'Having the form of an arch; curved.'),
(3736, 'Arctic', 'a.', 'Pertaining to, or situated under, the northern\n   constellation called the Bear; northern; frigid; as, the arctic pole,\n   circle, region, ocean; an arctic expedition, night, temperature.'),
(3737, 'Arctic', 'n.', 'The arctic circle.'),
(3738, 'Arctic', 'n.', 'A warm waterproof overshoe.'),
(3739, 'Arctisca', 'n. pl.', 'A group of Arachnida. See Illust. in Appendix.'),
(3740, 'Arcturus', 'n.', 'A fixed star of the first magnitude in the constellation\n   Bootes.'),
(3741, 'Arcual', 'a.', 'Of or pertaining to an arc.'),
(3742, 'Arcuate', 'a.', 'Alt. of Arcuated'),
(3743, 'Arcuated', 'a.', 'Bent or curved in the form of a bow.'),
(3744, 'Arcubus', 'n.', 'See Arquebus.'),
(3745, 'Ardency', 'n.', 'Heat.'),
(3746, 'Ardency', 'n.', 'Warmth of passion or affection; ardor; vehemence;\n   eagerness; as, the ardency of love or zeal.'),
(3747, 'Ardent', 'a.', 'Hot or burning; causing a sensation of burning; fiery; as,\n   ardent spirits, that is, distilled liquors; an ardent fever.'),
(3748, 'Ardent', 'a.', 'Having the appearance or quality of fire; fierce; glowing;\n   shining; as, ardent eyes.'),
(3749, 'Ardent', 'a.', 'Warm, applied to the passions and affections; passionate;\n   fervent; zealous; vehement; as, ardent love, feelings, zeal, hope,\n   temper.'),
(3750, 'Ardently', 'adv.', 'In an ardent manner; eagerly; with warmth;\n   affectionately; passionately.'),
(3751, 'Ardor', 'n.', 'Heat, in a literal sense; as, the ardor of the sun\'s rays.'),
(3752, 'Ardor', 'n.', 'Warmth or heat of passion or affection; eagerness; zeal; as,\n   he pursues study with ardor; the fought with ardor; martial ardor.'),
(3753, 'Ardor', 'n.', 'Bright and effulgent spirits; seraphim.'),
(3754, 'Arduous', 'a.', 'Steep and lofty, in a literal sense; hard to climb.'),
(3755, 'Arduous', 'a.', 'Attended with great labor, like the ascending of\n   acclivities; difficult; laborious; as, an arduous employment, task, or\n   enterprise.'),
(3756, 'Ardurous', 'a.', 'Burning; ardent.'),
(3757, 'Areas', 'pl. ', 'of Area'),
(3758, 'Aread', 'v. t.', 'Alt. of Areed'),
(3759, 'Areed', 'v. t.', 'To tell, declare, explain, or interpret; to divine; to\n   guess; as, to aread a riddle or a dream.'),
(3760, 'Areed', 'v. t.', 'To read.'),
(3761, 'Areed', 'v. t.', 'To counsel, advise, warn, or direct.'),
(3762, 'Areed', 'v. t.', 'To decree; to adjudge.'),
(3763, 'Areal', 'a.', 'Of or pertaining to an area; as, areal interstices (the\n   areas or spaces inclosed by the reticulate vessels of leaves).'),
(3764, 'Arear', 'v. t. & i.', 'To raise; to set up; to stir up.'),
(3765, 'Arear', 'adv.', 'Backward; in or to the rear; behindhand.'),
(3766, 'Areca', 'n.', 'A genus of palms, one species of which produces the areca\n   nut, or betel nut, which is chewed in India with the leaf of the Piper\n   Betle and lime.'),
(3767, 'Areek', 'adv. & a.', 'In a reeking condition.'),
(3768, 'Arefy', 'v. t.', 'To dry, or make dry.'),
(3769, 'Arenas', 'pl. ', 'of Arena'),
(3770, 'Arenae', 'pl. ', 'of Arena'),
(3771, 'Arena', 'n.', 'The area in the central part of an amphitheater, in which\n   the gladiators fought and other shows were exhibited; -- so called\n   because it was covered with sand.'),
(3772, 'Arena', 'n.', 'Any place of public contest or exertion; any sphere of\n   action; as, the arenaof debate; the arena of life.'),
(3773, 'Arena', 'n.', '\"Sand\" or \"gravel\" in the kidneys.'),
(3774, 'Areng', 'n.', 'Alt. of Arenga'),
(3775, 'Arenga', 'n.', 'A palm tree (Saguerus saccharifer) which furnishes sago,\n   wine, and fibers for ropes; the gomuti palm.'),
(3776, 'Arenose', 'a.', 'Sandy; full of sand.'),
(3777, 'Areolae', 'pl. ', 'of Areola'),
(3778, 'Areola', 'n.', 'An interstice or small space, as between the cracks of the\n   surface in certain crustaceous lichens; or as between the fibers\n   composing organs or vessels that interlace; or as between the nervures\n   of an insect\'s wing.'),
(3779, 'Areola', 'n.', 'The colored ring around the nipple, or around a vesicle or\n   pustule.'),
(3780, 'Areolar', 'a.', 'Pertaining to, or like, an areola; filled with interstices\n   or areolae.'),
(3781, 'Areolate', 'a.', 'Alt. of Areolated'),
(3782, 'Areole', 'n.', 'Same as Areola.'),
(3783, 'Areolet', 'n.', 'A small inclosed area; esp. one of the small spaces on the\n   wings of insects, circumscribed by the veins.'),
(3784, 'Arere', 'v. t. & i.', 'See Arear.'),
(3785, 'Arest', 'n.', 'A support for the spear when couched for the attack.'),
(3786, 'Aretaics', 'n.', 'The ethical theory which excludes all relations between\n   virtue and happiness; the science of virtue; -- contrasted with\n   eudemonics.'),
(3787, 'Argal', 'n.', 'Crude tartar. See Argol.'),
(3788, 'Argal', 'adv.', 'A ludicrous corruption of the Latin word ergo, therefore.'),
(3789, 'Argal', 'n.', 'Alt. of Argali'),
(3790, 'Argali', 'n.', 'A species of wild sheep (Ovis ammon, or O. argali),\n   remarkable for its large horns. It inhabits the mountains of Siberia\n   and central Asia.'),
(3791, 'Argala', 'n.', 'The adjutant bird.'),
(3792, 'Argas', 'n.', 'A genus of venomous ticks which attack men and animals. The\n   famous Persian Argas, also called Miana bug, is A. Persicus; that of\n   Central America, called talaje by the natives, is A. Talaje.'),
(3793, 'Argean', 'a.', 'Pertaining to the ship Argo. See Argo.'),
(3794, 'Argent', 'n.', 'Silver, or money.'),
(3795, 'Argent', 'n.', 'Whiteness; anything that is white.'),
(3796, 'Argent', 'n.', 'The white color in coats of arms, intended to represent\n   silver, or, figuratively, purity, innocence, beauty, or gentleness; --\n   represented in engraving by a plain white surface.'),
(3797, 'Argent', 'a.', 'Made of silver; of a silvery color; white; shining.'),
(3798, 'Argental', 'a.', 'Of or pertaining to silver; resembling, containing, or\n   combined with, silver.'),
(3799, 'Argentan', 'n.', 'An alloy of nickel with copper and zinc; German silver.'),
(3800, 'Argentic', 'a.', 'Pertaining to, derived from, or containing, silver; --\n   said of certain compounds of silver in which this metal has its lowest\n   proportion; as, argentic chloride.'),
(3801, 'Argentry', 'n.', 'Silver plate or vessels.'),
(3802, 'Argil', 'n.', 'Clay, or potter\'s earth; sometimes pure clay, or alumina.\n   See Clay.'),
(3803, 'Argive', 'a.', 'Of or performance to Argos, the capital of Argolis in\n   Greece.'),
(3804, 'Argive', 'n.', 'A native of Argos. Often used as a generic term, equivalent\n   to Grecian or Greek.'),
(3805, 'Argoan', 'a.', 'Pertaining to the ship Argo.'),
(3806, 'Argoile', 'n.', 'Potter\'s clay.'),
(3807, 'Argol', 'n.', 'Crude tartar; an acidulous salt from which cream of tartar\n   is prepared. It exists in the juice of grapes, and is deposited from\n   wines on the sides of the casks.'),
(3808, 'Argolic', 'a.', 'Pertaining to Argolis, a district in the Peloponnesus.'),
(3809, 'Argon', 'n.', 'A substance regarded as an element, contained in the\n   atmosphere and remarkable for its chemical inertness.'),
(3810, 'Argonaut', 'n.', 'Any one of the legendary Greek heroes who sailed with\n   Jason, in the Argo, in quest of the Golden Fleece.'),
(3811, 'Argonaut', 'n.', 'A cephalopod of the genus Argonauta.'),
(3812, 'Argosies', 'pl. ', 'of Argosy'),
(3813, 'Argosy', 'n.', 'A large ship, esp. a merchant vessel of the largest size.'),
(3814, 'Argot', 'n.', 'A secret language or conventional slang peculiar to thieves,\n   tramps, and vagabonds; flash.'),
(3815, 'Arguable', 'a.', 'Capable of being argued; admitting of debate.'),
(3816, 'Argued', 'imp. & p. p.', 'of Argue'),
(3817, 'Arguing', 'p. pr. & vb. n.', 'of Argue'),
(3818, 'Argue', 'v. i.', 'To invent and offer reasons to support or overthrow a\n   proposition, opinion, or measure; to use arguments; to reason.'),
