(3821, 'Argue', 'v. t.', 'To prove or evince; too manifest or exhibit by inference,\n   deduction, or reasoning.'),
(3822, 'Argue', 'v. t.', 'To persuade by reasons; as, to argue a man into a\n   different opinion.'),
(3823, 'Argue', 'v. t.', 'To blame; to accuse; to charge with.'),
(3824, 'Arguer', 'n.', 'One who argues; a reasoner; a disputant.'),
(3825, 'Argufy', 'v. t. & i.', 'To argue pertinaciously.'),
(3826, 'Argufy', 'v. t. & i.', 'To signify.'),
(3827, 'Argulus', 'n.', 'A genus of copepod Crustacea, parasitic of fishes; a fish\n   louse. See Branchiura.'),
(3828, 'Argument', 'n.', 'Proof; evidence.'),
(3829, 'Argument', 'n.', 'A reason or reasons offered in proof, to induce belief,\n   or convince the mind; reasoning expressed in words; as, an argument\n   about, concerning, or regarding a proposition, for or in favor of it,\n   or against it.'),
(3830, 'Argument', 'n.', 'A process of reasoning, or a controversy made up of\n   rational proofs; argumentation; discussion; disputation.'),
(3831, 'Argument', 'n.', 'The subject matter of a discourse, writing, or artistic\n   representation; theme or topic; also, an abstract or summary, as of the\n   contents of a book, chapter, poem.'),
(3832, 'Argument', 'n.', 'Matter for question; business in hand.'),
(3833, 'Argument', 'n.', 'The quantity on which another quantity in a table\n   depends; as, the altitude is the argument of the refraction.'),
(3834, 'Argument', 'n.', 'The independent variable upon whose value that of a\n   function depends.'),
(3835, 'Argument', 'v. i.', 'To make an argument; to argue.'),
(3836, 'Argus', 'n.', 'A fabulous being of antiquity, said to have had a hundred\n   eyes, who has placed by Juno to guard Io. His eyes were transplanted to\n   the peacock\'s tail.'),
(3837, 'Argus', 'n.', 'One very vigilant; a guardian always watchful.'),
(3838, 'Argus', 'n.', 'A genus of East Indian pheasants. The common species (A.\n   giganteus) is remarkable for the great length and beauty of the wing\n   and tail feathers of the male. The species A. Grayi inhabits Borneo.'),
(3839, 'Argute', 'a.', 'Sharp; shrill.'),
(3840, 'Argute', 'a.', 'Sagacious; acute; subtle; shrewd.'),
(3841, 'Argutely', 'adv.', 'In a subtle; shrewdly.'),
(3842, 'Arhizal', 'a.', 'Alt. of Arhythmous'),
(3843, 'Arhizous', 'a.', 'Alt. of Arhythmous'),
(3844, 'Arian', 'a. & n.', 'See Aryan.'),
(3845, 'Arian', 'a.', 'Pertaining to Arius, a presbyter of the church of\n   Alexandria, in the fourth century, or to the doctrines of Arius, who\n   held Christ to be inferior to God the Father in nature and dignity,\n   though the first and noblest of all created beings.'),
(3846, 'Arian', 'n.', 'One who adheres to or believes the doctrines of Arius.'),
(3847, 'Arianism', 'n.', 'The doctrines of the Arians.'),
