(3851, 'Aridity', 'n.', 'The state or quality of being arid or without moisture;\n   dryness.'),
(3852, 'Aridity', 'n.', 'Fig.: Want of interest of feeling; insensibility; dryness\n   of style or feeling; spiritual drought.'),
(3853, 'Aridness', 'n.', 'Aridity; dryness.'),
(3854, 'Ariel', '', 'Alt. of Ariel gazelle'),
(3855, 'Aries', 'n.', 'The Ram; the first of the twelve signs in the zodiac, which\n   the sun enters at the vernal equinox, about the 21st of March.'),
(3856, 'Aries', 'n.', 'A constellation west of Taurus, drawn on the celestial globe\n   in the figure of a ram.'),
