(3869, 'Arose', 'imp.', 'of Arise'),
(3870, 'Arising', 'p. pr. & vb. n.', 'of Arise'),
(3871, 'Arisen', 'p. p.', 'of Arise'),
(3872, 'Arise', 'v. i.', 'To come up from a lower to a higher position; to come\n   above the horizon; to come up from one\'s bed or place of repose; to\n   mount; to ascend; to rise; as, to arise from a kneeling posture; a\n   cloud arose; the sun ariseth; he arose early in the morning.'),
(3873, 'Arise', 'v. i.', 'To spring up; to come into action, being, or notice; to\n   become operative, sensible, or visible; to begin to act a part; to\n   present itself; as, the waves of the sea arose; a persecution arose;\n   the wrath of the king shall arise.'),
(3874, 'Arise', 'v. i.', 'To proceed; to issue; to spring.'),
(3875, 'Arise', 'n.', 'Rising.'),
(3876, 'Arist', '', '3d sing. pres. of Arise, for ariseth.'),
(3877, 'Arista', 'n.', 'An awn.'),
(3878, 'Aristate', 'a.', 'Having a pointed, beardlike process, as the glumes of\n   wheat; awned.'),
(3879, 'Aristate', 'a.', 'Having a slender, sharp, or spinelike tip.'),
(3880, 'Arkite', 'a.', 'Belonging to the ark.'),
(3881, 'Arles', 'n. pl.', 'An earnest; earnest money; money paid to bind a bargain.'),
(3882, 'Armed', 'imp. & p. p.', 'of Arm'),
(3883, 'Arming', 'p. pr. & vb. n.', 'of Arm'),
