(3895, 'Armed', 'a.', 'Having horns, beak, talons, etc; -- said of beasts and birds\n   of prey.'),
(3896, 'Armenian', 'a.', 'Of or pertaining to Armenia.'),
(3897, 'Armenian', 'n.', 'A native or one of the people of Armenia; also, the\n   language of the Armenians.'),
(3898, 'Armenian', 'n.', 'An adherent of the Armenian Church, an organization\n   similar in some doctrines and practices to the Greek Church, in others\n   to the Roman Catholic.'),
