(3902, 'Armgaunt', 'a.', 'With gaunt or slender legs. (?)'),
(3903, 'Arm-gret', 'a.', 'Great as a man\'s arm.'),
(3904, 'Armhole', 'n.', 'The cavity under the shoulder; the armpit.'),
(3905, 'Armhole', 'n.', 'A hole for the arm in a garment.'),
(3906, 'Armiger', 'n.', 'Formerly, an armor bearer, as of a knight, an esquire who\n   bore his shield and rendered other services. In later use, one next in\n   degree to a knight, and entitled to armorial bearings. The term is now\n   superseded by esquire.'),
(3907, 'Armil', 'n.', 'A bracelet.'),
(3908, 'Armil', 'n.', 'An ancient astronomical instrument.'),
(3909, 'Armillas', 'pl. ', 'of Armilla'),
(3910, 'Armillae', 'pl. ', 'of Armilla'),
(3911, 'Armilla', 'n.', 'An armil.'),
(3912, 'Armilla', 'n.', 'A ring of hair or feathers on the legs.'),
(3913, 'Arming', 'n.', 'The act of furnishing with, or taking, arms.'),
(3914, 'Arming', 'n.', 'A piece of tallow placed in a cavity at the lower end of a\n   sounding lead, to bring up the sand, shells, etc., of the sea bottom.'),
(3915, 'Arming', 'n.', 'Red dress cloths formerly hung fore and aft outside of a\n   ship\'s upper works on holidays.'),
(3916, 'Arminian', 'a.', 'Of or pertaining to Arminius of his followers, or to\n   their doctrines. See note under Arminian, n.'),
(3917, 'Arminian', 'n.', 'One who holds the tenets of Arminius, a Dutch divine (b.\n   1560, d. 1609).'),
(3918, 'Armless', 'a.', 'Without any arm or branch.'),
(3919, 'Armless', 'a.', 'Destitute of arms or weapons.'),
(3920, 'Armlet', 'n.', 'A small arm; as, an armlet of the sea.'),
(3921, 'Armlet', 'n.', 'An arm ring; a bracelet for the upper arm.'),
(3922, 'Armlet', 'n.', 'Armor for the arm.'),
(3923, 'Armoniac', 'a.', 'Ammoniac.'),
