(3926, 'Armored', 'a.', 'Clad with armor.'),
(3927, 'Armorer', 'n.', 'One who makes or repairs armor or arms.'),
(3928, 'Armorer', 'n.', 'Formerly, one who had care of the arms and armor of a\n   knight, and who dressed him in armor.'),
(3929, 'Armorer', 'n.', 'One who has the care of arms and armor, cleans or repairs\n   them, etc.'),
