(3933, 'Armories', 'pl. ', 'of Armory'),
(3934, 'Armory', 'n.', 'A place where arms and instruments of war are deposited for\n   safe keeping.'),
(3935, 'Armory', 'n.', 'Armor; defensive and offensive arms.'),
