(3950, 'Arnot', 'n.', 'Alt. of Arnut'),
(3951, 'Arnut', 'n.', 'The earthnut.'),
(3952, 'Arnotto', 'n.', 'Same as Annotto.'),
(3953, 'Aroid', 'a.', 'Alt. of Aroideous'),
(3954, 'Aroint', 'interj.', 'Stand off, or begone.'),
