(3958, 'Aromatic', 'a.', 'Alt. of Aromatical'),
(3959, 'Aromatic', 'n.', 'A plant, drug, or medicine, characterized by a fragrant\n   smell, and usually by a warm, pungent taste, as ginger, cinnamon,\n   spices.'),
