(3967, 'Arousal', 'n.', 'The act of arousing, or the state of being aroused.'),
(3968, 'Aroused', 'imp. & p. p.', 'of Arouse'),
(3969, 'Arousing', 'p. pr. & vb. n.', 'of Arouse'),
(3970, 'Arouse', 'v. t.', 'To excite to action from a state of rest; to stir, or\n   put in motion or exertion; to rouse; to excite; as, to arouse one from\n   sleep; to arouse the dormant faculties.'),
