(3975, 'Arpine', 'n.', 'An arpent.'),
(3976, 'Arquated', 'a.', 'Shaped like a bow; arcuate; curved.'),
(3977, 'Arquebus', 'n.', 'Alt. of Arquebuse'),
(3978, 'Arrach', 'n.', 'See Orach.'),
(3979, 'Arrack', 'n.', 'A name in the East Indies and the Indian islands for all\n   ardent spirits. Arrack is often distilled from a fermented mixture of\n   rice, molasses, and palm wine of the cocoanut tree or the date palm,\n   etc.'),
(3980, 'Arraign', 'v. t.', 'To call or set as a prisoner at the bar of a court to\n   answer to the matter charged in an indictment or complaint.'),
