(3994, 'Arrastre', 'n.', 'A rude apparatus for pulverizing ores, esp. those\n   containing free gold.'),
(3995, 'Arraught', '', 'Obtained; seized.'),
(3996, 'Array', 'n.', 'Order; a regular and imposing arrangement; disposition in\n   regular lines; hence, order of battle; as, drawn up in battle array.'),
(3997, 'Array', 'n.', 'The whole body of persons thus placed in order; an orderly\n   collection; hence, a body of soldiers.'),
(3998, 'Array', 'n.', 'An imposing series of things.'),
(3999, 'Array', 'n.', 'Dress; garments disposed in order upon the person; rich or\n   beautiful apparel.'),
(4000, 'Array', 'n.', 'A ranking or setting forth in order, by the proper officer,\n   of a jury as impaneled in a cause.'),
(4001, 'Array', 'n.', 'The panel itself.'),
(4002, 'Array', 'n.', 'The whole body of jurors summoned to attend the court.'),
(4003, 'Arrayed', 'imp. & p. p.', 'of Array'),
(4004, 'Arraying', 'p. pr. & vb. n.', 'of Array'),
(4005, 'Array', 'n.', 'To place or dispose in order, as troops for battle; to\n   marshal.'),
(4006, 'Array', 'n.', 'To deck or dress; to adorn with dress; to cloth to envelop;\n   -- applied esp. to dress of a splendid kind.'),
(4007, 'Array', 'n.', 'To set in order, as a jury, for the trial of a cause; that\n   is, to call them man by man.'),
(4008, 'Arrayer', 'n.', 'One who arrays. In some early English statutes, applied to\n   an officer who had care of the soldiers\' armor, and who saw them duly\n   accoutered.'),
(4009, 'Arrear', 'adv.', 'To or in the rear; behind; backwards.'),
(4010, 'Arrear', 'n.', 'That which is behind in payment, or which remains unpaid,\n   though due; esp. a remainder, or balance which remains due when some\n   part has been paid; arrearage; -- commonly used in the plural, as,\n   arrears of rent, wages, or taxes.'),
(4011, 'Arrect', 'a.', 'Alt. of Arrected'),
(4012, 'Arrected', 'a.', 'Lifted up; raised; erect.'),
(4013, 'Arrected', 'a.', 'Attentive, as a person listening.'),
(4014, 'Arrect', 'v. t.', 'To direct.'),
(4015, 'Arrect', 'v. t.', 'To impute.'),
(4016, 'Arrested', 'imp. & p. p.', 'of Arrest'),
(4017, 'Arrest', 'v. t.', 'To stop; to check or hinder the motion or action of; as,\n   to arrest the current of a river; to arrest the senses.'),
(4018, 'Arrest', 'v. t.', 'To take, seize, or apprehend by authority of law; as, to\n   arrest one for debt, or for a crime.'),
(4019, 'Arrest', 'v. t.', 'To seize on and fix; to hold; to catch; as, to arrest\n   the eyes or attention.'),
(4020, 'Arrest', 'v. t.', 'To rest or fasten; to fix; to concentrate.'),
(4021, 'Arrest', 'v. i.', 'To tarry; to rest.'),
