(4026, 'Arrestee', 'v.', 'The person in whose hands is the property attached by\n   arrestment.'),
(4027, 'Arrester', 'n.', 'One who arrests.'),
(4028, 'Arrester', 'n.', 'The person at whose suit an arrestment is made.'),
(4029, 'Arret', 'n.', 'A judgment, decision, or decree of a court or high tribunal;\n   also, a decree of a sovereign.'),
(4030, 'Arret', 'n.', 'An arrest; a legal seizure.'),
(4031, 'Arret', 'v. t.', 'Same as Aret.'),
(4032, 'Arrhizal', 'a.', 'Alt. of Arrhizous'),
(4033, 'Arrhytmy', 'n.', 'Want of rhythm.'),
(4034, 'Arride', 'v. t.', 'To please; to gratify.'),
