(4045, 'Arrive', 'v. i.', 'To reach a point by progressive motion; to gain or\n   compass an object by effort, practice, study, inquiry, reasoning, or\n   experiment.'),
(4046, 'Arrive', 'v. i.', 'To come; said of time; as, the time arrived.'),
(4047, 'Arrive', 'v. i.', 'To happen or occur.'),
(4048, 'Arrive', 'v. t.', 'To bring to shore.'),
(4049, 'Arrive', 'v. t.', 'To reach; to come to.'),
(4050, 'Arrive', 'n.', 'Arrival.'),
(4051, 'Arriver', 'n.', 'One who arrives.'),
(4052, 'Arroba', 'n.', 'A Spanish weight used in Mexico and South America = 25.36\n   lbs. avoir.; also, an old Portuguese weight, used in Brazil = 32.38\n   lbs. avoir.'),
(4053, 'Arroba', 'n.', 'A Spanish liquid measure for wine = 3.54 imp. gallons, and\n   for oil = 2.78 imp. gallons.'),
(4054, 'Arrogant', 'a.', 'Making, or having the disposition to make, exorbitant\n   claims of rank or estimation; giving one\'s self an undue degree of\n   importance; assuming; haughty; -- applied to persons.'),
(4055, 'Arrogant', 'a.', 'Containing arrogance; marked with arrogance; proceeding\n   from undue claims or self-importance; -- applied to things; as,\n   arrogant pretensions or behavior.'),
(4056, 'Arrogate', 'v. t.', 'To assume, or claim as one\'s own, unduly, proudly, or\n   presumptuously; to make undue claims to, from vanity or baseless\n   pretensions to right or merit; as, the pope arrogated dominion over\n   kings.'),
(4057, 'Arrose', 'v. t.', 'To drench; to besprinkle; to moisten.'),
(4058, 'Arrosion', 'n.', 'A gnawing.'),
(4059, 'Arrow', 'n.', 'A missile weapon of offense, slender, pointed, and usually\n   feathered and barbed, to be shot from a bow.'),
(4060, 'Arrowy', 'a.', 'Consisting of arrows.'),
(4061, 'Arrowy', 'a.', 'Formed or moving like, or in any respect resembling, an\n   arrow; swift; darting; piercing.'),
(4062, 'Arroyos', 'pl. ', 'of Arroyo'),
(4063, 'Arroyo', 'n.', 'A water course; a rivulet.'),
(4064, 'Arroyo', 'n.', 'The dry bed of a small stream.'),
(4065, 'Arschin', 'n.', 'See Arshine.'),
(4066, 'Arsenal', 'n.', 'A public establishment for the storage, or for the\n   manufacture and storage, of arms and all military equipments, whether\n   for land or naval service.'),
(4067, 'Arsenate', 'n.', 'A salt of arsenic acid.'),
(4068, 'Arsenic', 'n.', 'One of the elements, a solid substance resembling a metal\n   in its physical properties, but in its chemical relations ranking with\n   the nonmetals. It is of a steel-gray color and brilliant luster, though\n   usually dull from tarnish. It is very brittle, and sublimes at 356¡\n   Fahrenheit. It is sometimes found native, but usually combined with\n   silver, cobalt, nickel, iron, antimony, or sulphur. Orpiment and\n   realgar are two of its sulphur compounds, the first of which is the\n   true arsenicum of the ancients. The element and its compounds are\n   active poisons. Specific gravity from 5.7 to 5.9. Atomic weight 75.\n   Symbol As.'),
(4069, 'Arsenic', 'n.', 'Arsenious oxide or arsenious anhydride; -- called also\n   arsenious acid, white arsenic, and ratsbane.'),
(4070, 'Arsenic', 'a.', 'Pertaining to, or derived from, arsenic; -- said of those\n   compounds of arsenic in which this element has its highest equivalence;\n   as, arsenic acid.'),
(4071, 'Arsenide', 'n.', 'A compound of arsenic with a metal, or positive element\n   or radical; -- formerly called arseniuret.'),
(4072, 'Arsenite', 'n.', 'A salt formed by the union of arsenious acid with a base.'),
(4073, 'Arshine', 'n.', 'A Russian measure of length = 2 ft. 4.246 inches.'),
(4074, 'Arsine', 'n.', 'A compound of arsenic and hydrogen, AsH3, a colorless and\n   exceedingly poisonous gas, having an odor like garlic; arseniureted\n   hydrogen.'),
(4075, 'Arsis', 'n.', 'That part of a foot where the ictus is put, or which is\n   distinguished from the rest (known as the thesis) of the foot by a\n   greater stress of voice.'),
(4076, 'Arsis', 'n.', 'That elevation of voice now called metrical accentuation, or\n   the rhythmic accent.'),
(4077, 'Arsis', 'n.', 'The elevation of the hand, or that part of the bar at which\n   it is raised, in beating time; the weak or unaccented part of the bar;\n   -- opposed to thesis.'),
(4078, 'Arson', 'n.', 'The malicious burning of a dwelling house or outhouse of\n   another man, which by the common law is felony; the malicious and\n   voluntary firing of a building or ship.'),
(4079, 'Artemia', 'n.', 'A genus of phyllopod Crustacea found in salt lakes and\n   brines; the brine shrimp. See Brine shrimp.'),
(4080, 'Arteriac', 'a.', 'Of or pertaining to the windpipe.'),
(4081, 'Arterial', 'a.', 'Of or pertaining to an artery, or the arteries; as,\n   arterial action; the arterial system.'),
(4082, 'Arterial', 'a.', 'Of or pertaining to a main channel (resembling an\n   artery), as a river, canal, or railroad.'),
(4083, 'Arteries', 'pl. ', 'of Artery'),
(4084, 'Artery', 'n.', 'The trachea or windpipe.'),
(4085, 'Artery', 'n.', 'One of the vessels or tubes which carry either venous or\n   arterial blood from the heart. They have tricker and more muscular\n   walls than veins, and are connected with them by capillaries.'),
(4086, 'Artery', 'n.', 'Hence: Any continuous or ramified channel of communication;\n   as, arteries of trade or commerce.'),
(4087, 'Artesian', 'a.', 'Of or pertaining to Artois (anciently called Artesium),\n   in France.'),
(4088, 'Artful', 'a.', 'Performed with, or characterized by, art or skill.'),
(4089, 'Artful', 'a.', 'Artificial; imitative.'),
(4090, 'Artful', 'a.', 'Using or exhibiting much art, skill, or contrivance;\n   dexterous; skillful.'),
(4091, 'Artful', 'a.', 'Cunning; disposed to cunning indirectness of dealing;\n   crafty; as, an artful boy. [The usual sense.]'),
(4092, 'Artfully', 'adv.', 'In an artful manner; with art or cunning; skillfully;\n   dexterously; craftily.'),
(4093, 'Arthen', 'a.', 'Same as'),
(4094, 'Artiad', 'a.', 'Even; not odd; -- said of elementary substances and of\n   radicals the valence of which is divisible by two without a remainder.'),
(4095, 'Article', 'n.', 'A distinct portion of an instrument, discourse, literary\n   work, or any other writing, consisting of two or more particulars, or\n   treating of various topics; as, an article in the Constitution. Hence:\n   A clause in a contract, system of regulations, treaty, or the like; a\n   term, condition, or stipulation in a contract; a concise statement; as,\n   articles of agreement.'),
(4096, 'Article', 'n.', 'A literary composition, forming an independent portion of\n   a magazine, newspaper, or cyclopedia.'),
(4097, 'Article', 'n.', 'Subject; matter; concern; distinct.'),
(4098, 'Article', 'n.', 'A distinct part.'),
(4099, 'Article', 'n.', 'A particular one of various things; as, an article of\n   merchandise; salt is a necessary article.'),
(4100, 'Article', 'n.', 'Precise point of time; moment.'),
(4101, 'Article', 'n.', 'One of the three words, a, an, the, used before nouns to\n   limit or define their application. A (or an) is called the indefinite\n   article, the the definite article.'),
(4102, 'Article', 'n.', 'One of the segments of an articulated appendage.'),
(4103, 'Articled', 'imp. & p. p.', 'of Article'),
(4104, 'Article', 'n.', 'To formulate in articles; to set forth in distinct\n   particulars.'),
(4105, 'Article', 'n.', 'To accuse or charge by an exhibition of articles.'),
(4106, 'Article', 'n.', 'To bind by articles of covenant or stipulation; as, to\n   article an apprentice to a mechanic.'),
(4107, 'Article', 'v. i.', 'To agree by articles; to stipulate; to bargain; to\n   covenant.'),
(4108, 'Articled', 'a.', 'Bound by articles; apprenticed; as, an articled clerk.'),
(4109, 'Articuli', 'pl. ', 'of Articulus'),
(4110, 'Artifice', 'n.', 'A handicraft; a trade; art of making.'),
(4111, 'Artifice', 'n.', 'Workmanship; a skillfully contrived work.'),
(4112, 'Artifice', 'n.', 'Artful or skillful contrivance.'),
(4113, 'Artifice', 'n.', 'Crafty device; an artful, ingenious, or elaborate trick.\n   [Now the usual meaning.]'),
(4114, 'Artilize', 'v. t.', 'To make resemble.'),
(4115, 'Artisan', 'n.', 'One who professes and practices some liberal art; an\n   artist.'),
(4116, 'Artisan', 'n.', 'One trained to manual dexterity in some mechanic art or\n   trade; and handicraftsman; a mechanic.'),
(4117, 'Artist', 'n.', 'One who practices some mechanic art or craft; an artisan.'),
(4118, 'Artist', 'n.', 'One who professes and practices an art in which science and\n   taste preside over the manual execution.'),
(4119, 'Artist', 'n.', 'One who shows trained skill or rare taste in any manual art\n   or occupation.'),
(4120, 'Artist', 'n.', 'An artful person; a schemer.'),
(4121, 'Artiste', 'n.', 'One peculiarly dexterous and tasteful in almost any\n   employment, as an opera dancer, a hairdresser, a cook.'),
(4122, 'Artistic', 'a.', 'Alt. of Artistical'),
(4123, 'Artistry', 'n.', 'Works of art collectively.'),
(4124, 'Artistry', 'n.', 'Artistic effect or quality.'),
(4125, 'Artistry', 'n.', 'Artistic pursuits; artistic ability.'),
(4126, 'Artless', 'a.', 'Wanting art, knowledge, or skill; ignorant; unskillful.'),
(4127, 'Artless', 'a.', 'Contrived without skill or art; inartistic.'),
(4128, 'Artless', 'a.', 'Free from guile, art, craft, or stratagem; characterized\n   by simplicity and sincerity; sincere; guileless; ingenuous; honest; as,\n   an artless mind; an artless tale.'),
(4129, 'Artly', 'adv.', 'With art or skill.'),
(4130, 'Artotype', 'n.', 'A kind of autotype.'),
(4131, 'Artow', '', 'A contraction of art thou.'),
(4132, 'Artsman', 'n.', 'A man skilled in an art or in arts.'),
(4133, 'Aruspex', 'n.', 'One of the class of diviners among the Etruscans and\n   Romans, who foretold events by the inspection of the entrails of\n   victims offered on the altars of the gods.'),
(4134, 'Aruspice', 'n.', 'A soothsayer of ancient Rome. Same as Aruspex.'),
(4135, 'Aruspicy', 'n.', 'Prognostication by inspection of the entrails of victims\n   slain sacrifice.'),
(4136, 'Arval', 'n.', 'A funeral feast.'),
(4137, 'Arvicole', 'n.', 'A mouse of the genus Arvicola; the meadow mouse. There\n   are many species.'),
(4138, 'Aryan', 'n.', 'One of a primitive people supposed to have lived in\n   prehistoric times, in Central Asia, east of the Caspian Sea, and north\n   of the Hindoo Koosh and Paropamisan Mountains, and to have been the\n   stock from which sprang the Hindoo, Persian, Greek, Latin, Celtic,\n   Teutonic, Slavonic, and other races; one of that ethnological division\n   of mankind called also Indo-European or Indo-Germanic.'),
(4139, 'Aryan', 'n.', 'The language of the original Aryans.'),
(4140, 'Aryan', 'a.', 'Of or pertaining to the people called Aryans; Indo-European;\n   Indo-Germanic; as, the Aryan stock, the Aryan languages.'),
(4141, 'Aryanize', 'v. t.', 'To make Aryan (a language, or in language).'),
(4142, 'Asses', 'pl. ', 'of As'),
(4143, 'Asaphus', 'n.', 'A genus of trilobites found in the Lower Silurian\n   formation. See Illust. in Append.'),
(4144, 'Asarone', 'n.', 'A crystallized substance, resembling camphor, obtained\n   from the Asarum Europaeum; -- called also camphor of asarum.'),
(4145, 'Asbestic', 'a.', 'Of, pertaining to, or resembling asbestus; inconsumable;\n   asbestine.'),
(4146, 'Asbestus', 'n.', 'Alt. of Asbestos'),
(4147, 'Asbestos', 'n.', 'A variety of amphibole or of pyroxene, occurring in long\n   and delicate fibers, or in fibrous masses or seams, usually of a white,\n   gray, or green-gray color. The name is also given to a similar variety\n   of serpentine.'),
(4148, 'Asbolin', 'n.', 'A peculiar acrid and bitter oil, obtained from wood soot.'),
(4149, 'Ascarid', 'n.', 'A parasitic nematoid worm, espec. the roundworm, Ascaris\n   lumbricoides, often occurring in the human intestine, and allied\n   species found in domestic animals; also commonly applied to the pinworm\n   (Oxyuris), often troublesome to children and aged persons.'),
(4150, 'Ascended', 'imp. & p. p.', 'of Ascend'),
(4151, 'Ascend', 'v. i.', 'To move upward; to mount; to go up; to rise; -- opposed\n   to descend.'),
(4152, 'Ascend', 'v. i.', 'To rise, in a figurative sense; to proceed from an\n   inferior to a superior degree, from mean to noble objects, from\n   particulars to generals, from modern to ancient times, from one note to\n   another more acute, etc.; as, our inquiries ascend to the remotest\n   antiquity; to ascend to our first progenitor.'),
(4153, 'Ascend', 'v. t.', 'To go or move upward upon or along; to climb; to mount;\n   to go up the top of; as, to ascend a hill, a ladder, a tree, a river, a\n   throne.'),
(4154, 'Ascent', '', 'The act of rising; motion upward; rise; a mounting upward;\n   as, he made a tedious ascent; the ascent of vapors from the earth.'),
(4155, 'Ascent', '', 'The way or means by which one ascends.'),
(4156, 'Ascent', '', 'An eminence, hill, or high place.'),
(4157, 'Ascent', '', 'The degree of elevation of an object, or the angle it makes\n   with a horizontal line; inclination; rising grade; as, a road has an\n   ascent of five degrees.'),
(4158, 'Ascetic', 'a.', 'Extremely rigid in self-denial and devotions; austere;\n   severe.'),
(4159, 'Ascetic', 'n.', 'In the early church, one who devoted himself to a solitary\n   and contemplative life, characterized by devotion, extreme self-denial,\n   and self-mortification; a hermit; a recluse; hence, one who practices\n   extreme rigor and self-denial in religious things.'),
(4160, 'Ascham', 'n.', 'A sort of cupboard, or case, to contain bows and other\n   implements of archery.'),
(4161, 'Ascian', 'n.', 'One of the Ascii.'),
(4162, 'Ascidian', 'n.', 'One of the Ascidioidea, or in a more general sense, one\n   of the Tunicata. Also as an adj.'),
(4163, 'Ascidia', 'pl. ', 'of Ascidium'),
(4164, 'Ascidium', 'n.', 'A pitcher-shaped, or flask-shaped, organ or appendage of\n   a plant, as the leaves of the pitcher plant, or the little bladderlike\n   traps of the bladderwort (Utricularia).'),
(4165, 'Ascidium', 'n.', 'A genus of simple ascidians, which formerly included most\n   of the known species. It is sometimes used as a name for the\n   Ascidioidea, or for all the Tunicata.'),
(4166, 'Ascii', 'n. pl.', 'Alt. of Ascians'),
(4167, 'Ascians', 'n. pl.', 'Persons who, at certain times of the year, have no\n   shadow at noon; -- applied to the inhabitants of the torrid zone, who\n   have, twice a year, a vertical sun.'),
(4168, 'Ascites', 'n.', 'A collection of serous fluid in the cavity of the abdomen;\n   dropsy of the peritoneum.'),
(4169, 'Ascitic', 'a.', 'Alt. of Ascitical'),
(4170, 'Ascribed', 'imp. & p. p.', 'of Ascribe');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(4171, 'Ascribe', 'v. t.', 'To attribute, impute, or refer, as to a cause; as, his\n   death was ascribed to a poison; to ascribe an effect to the right\n   cause; to ascribe such a book to such an author.'),
(4172, 'Ascribe', 'v. t.', 'To attribute, as a quality, or an appurtenance; to\n   consider or allege to belong.'),
(4173, 'Ascript', 'a.', 'See Adscript.'),
(4174, 'Ascus', 'n.', 'A small membranous bladder or tube in which are inclosed the\n   seedlike reproductive particles or sporules of lichens and certain\n   fungi.'),
(4175, 'A-sea', 'adv.', 'On the sea; at sea; toward the sea.'),
(4176, 'Aseptic', 'a.', 'Not liable to putrefaction; nonputrescent.'),
(4177, 'Aseptic', 'n.', 'An aseptic substance.'),
(4178, 'Asexual', 'a.', 'Having no distinct sex; without sexual action; as, asexual\n   reproduction. See Fission and Gemmation.'),
(4179, 'Ashame', 'v. t.', 'To shame.'),
(4180, 'Ashamed', 'a.', 'Affected by shame; abashed or confused by guilt, or a\n   conviction or consciousness of some wrong action or impropriety.'),
(4181, 'Ashantee', 'n.', 'A native or an inhabitant of Ashantee in Western Africa.'),
(4182, 'Ashantee', 'a.', 'Of or pertaining to Ashantee.'),
(4183, 'Ashen', 'a.', 'Of or pertaining to the ash tree.'),
(4184, 'Ashen', 'a.', 'Consisting of, or resembling, ashes; of a color between\n   brown and gray, or white and gray.'),
(4185, 'Ashen', 'n.', 'obs. pl. for Ashes.'),
(4186, 'Ashery', 'n.', 'A depository for ashes.'),
(4187, 'Ashery', 'n.', 'A place where potash is made.'),
(4188, 'Ashes', 'n. pl.', 'The earthy or mineral particles of combustible\n   substances remaining after combustion, as of wood or coal.'),
(4189, 'Ashes', 'n. pl.', 'Specifically: The remains of the human body when burnt,\n   or when \"returned to dust\" by natural decay.'),
(4190, 'Ashes', 'n. pl.', 'The color of ashes; deathlike paleness.'),
(4191, 'Ash-fire', 'n.', 'A low fire used in chemical operations.'),
(4192, 'Ash-oven', 'n.', 'A furnace or oven for fritting materials for glass\n   making.'),
(4193, 'Ashine', 'a.', 'Shining; radiant.'),
(4194, 'Ashlar', 'n.', 'Alt. of Ashler'),
(4195, 'Ashler', 'n.', 'Hewn or squared stone; also, masonry made of squared or\n   hewn stone.'),
(4196, 'Ashler', 'n.', 'In the United States especially, a thin facing of squared\n   and dressed stone upon a wall of rubble or brick.'),
(4197, 'Ashore', 'adv.', 'On shore or on land; on the land adjacent to water; to\n   the shore; to the land; aground (when applied to a ship); -- sometimes\n   opposed to aboard or afloat.'),
(4198, 'Ashweed', 'n.', 'Goutweed.'),
(4199, 'Asian', 'a.', 'Of or pertaining to Asia; Asiatic.'),
(4200, 'Asian', 'n.', 'An Asiatic.'),
(4201, 'Asiarch', 'n.', 'One of the chiefs or pontiffs of the Roman province of\n   Asia, who had the superintendence of the public games and religious\n   rites.'),
(4202, 'Asiatic', 'a.', 'Of or pertaining to Asia or to its inhabitants.'),
(4203, 'Asiatic', 'n.', 'A native, or one of the people, of Asia.'),
(4204, 'Aside', 'adv.', 'On, or to, one side; out of a straight line, course, or\n   direction; at a little distance from the rest; out of the way; apart.'),
(4205, 'Aside', 'adv.', 'Out of one\'s thoughts; off; away; as, to put aside gloomy\n   thoughts.'),
(4206, 'Aside', 'adv.', 'So as to be heard by others; privately.'),
(4207, 'Aside', 'n.', 'Something spoken aside; as, a remark made by a stageplayer\n   which the other players are not supposed to hear.'),
(4208, 'Asilus', 'n.', 'A genus of large and voracious two-winged flies, including\n   the bee killer and robber fly.'),
(4209, 'Asinego', 'n.', 'Alt. of Assinego'),
(4210, 'Assinego', 'n.', 'A stupid fellow.'),
(4211, 'Asinine', 'a.', 'Of or belonging to, or having the qualities of, the ass,\n   as stupidity and obstinacy.'),
(4212, 'Asitia', 'n.', 'Want of appetite; loathing of food.'),
(4213, 'Asked', 'imp. & p. p.', 'of Ask'),
(4214, 'Asking', 'p. pr. & vb. n.', 'of Ask'),
(4215, 'Askance', 'adv.', 'Alt. of Askant'),
(4216, 'Askant', 'adv.', 'Sideways; obliquely; with a side glance; with disdain,\n   envy, or suspicion.'),
(4217, 'Askance', 'v. t.', 'To turn aside.'),
(4218, 'Asker', 'n.', 'One who asks; a petitioner; an inquirer.'),
(4219, 'Asker', 'n.', 'An ask; a water newt.'),
(4220, 'Askew', 'adv. & a.', 'Awry; askance; asquint; oblique or obliquely; --\n   sometimes indicating scorn, or contempt, or entry.'),
(4221, 'Asking', 'n.', 'The act of inquiring or requesting; a petition;\n   solicitation.'),
(4222, 'Asking', 'n.', 'The publishing of banns.'),
(4223, 'Aslake', 'v. t. & i.', 'To mitigate; to moderate; to appease; to abate; to\n   diminish.'),
(4224, 'Aslant', 'adv. & a.', 'Toward one side; in a slanting direction; obliquely.'),
(4225, 'Aslant', 'prep.', 'In a slanting direction over; athwart.'),
(4226, 'Asleep', 'a. & adv.', 'In a state of sleep; in sleep; dormant.'),
(4227, 'Asleep', 'a. & adv.', 'In the sleep of the grave; dead.'),
(4228, 'Asleep', 'a. & adv.', 'Numbed, and, usually, tingling.'),
(4229, 'Aslope', 'adv. & a.', 'Slopingly; aslant; declining from an upright\n   direction; sloping.'),
(4230, 'Aslug', 'adv.', 'Sluggishly.'),
(4231, 'Asmear', 'a.', 'Smeared over.'),
(4232, 'Asmonean', 'a.', 'Of or pertaining to the patriotic Jewish family to which\n   the Maccabees belonged; Maccabean; as, the Asmonean dynasty.'),
(4233, 'Asmonean', 'n.', 'One of the Asmonean family. The Asmoneans were leaders\n   and rulers of the Jews from 168 to 35 b. c.'),
(4234, 'Asoak', 'a.', 'Soaking.'),
(4235, 'Asonant', 'a.', 'Not sounding or sounded.'),
(4236, 'Aspartic', 'a.', 'Pertaining to, or derived, asparagine; as, aspartic acid.'),
(4237, 'Aspect', 'n.', 'The act of looking; vision; gaze; glance.'),
(4238, 'Aspect', 'n.', 'Look, or particular appearance of the face; countenance;\n   mien; air.'),
(4239, 'Aspect', 'n.', 'Appearance to the eye or the mind; look; view.'),
(4240, 'Aspect', 'n.', 'Position or situation with regard to seeing; that position\n   which enables one to look in a particular direction; position in\n   relation to the points of the compass; as, a house has a southern\n   aspect, that is, a position which faces the south.'),
(4241, 'Aspect', 'n.', 'Prospect; outlook.'),
(4242, 'Aspect', 'n.', 'The situation of planets or stars with respect to one\n   another, or the angle formed by the rays of light proceeding from them\n   and meeting at the eye; the joint look of planets or stars upon each\n   other or upon the earth.'),
(4243, 'Aspect', 'n.', 'The influence of the stars for good or evil; as, an ill\n   aspect.'),
(4244, 'Aspect', 'n.', 'To behold; to look at.'),
(4245, 'Aspected', 'a.', 'Having an aspect.'),
(4246, 'Aspen', 'n.', 'Alt. of Asp'),
(4247, 'Aspen', 'a.', 'Of or pertaining to the aspen, or resembling it; made of\n   aspen wood.'),
(4248, 'Asper', 'a.', 'Rough; rugged; harsh; bitter; stern; fierce.'),
(4249, 'Asper', 'n.', 'The rough breathing; a mark (/) placed over an initial vowel\n   sound or over / to show that it is aspirated, that is, pronounced with\n   h before it; thus \"ws, pronounced h/s, \"rh`twr, pronounced hra\"t/r.'),
(4250, 'Asper', 'n.', 'A Turkish money of account (formerly a coin), of little\n   value; the 120th part of a piaster.'),
(4251, 'Asperate', 'v. t.', 'To make rough or uneven.'),
(4252, 'Asperges', 'n.', 'The service or ceremony of sprinkling with holy water.'),
(4253, 'Asperges', 'n.', 'The brush or instrument used in sprinkling holy water; an\n   aspergill.'),
(4254, 'Asperity', 'n.', 'Roughness of surface; unevenness; -- opposed to\n   smoothness.'),
(4255, 'Asperity', 'n.', 'Roughness or harshness of sound; that quality which\n   grates upon the ear; raucity.'),
(4256, 'Asperity', 'n.', 'Roughness to the taste; sourness; tartness.'),
(4257, 'Asperity', 'n.', 'Moral roughness; roughness of manner; severity;\n   crabbedness; harshness; -- opposed to mildness.'),
(4258, 'Asperity', 'n.', 'Sharpness; disagreeableness; difficulty.'),
(4259, 'Asperne', 'v. t.', 'To spurn; to despise.'),
(4260, 'Asperous', 'a.', 'Rough; uneven.'),
(4261, 'Aspersed', 'imp. & p. p.', 'of Asperse'),
(4262, 'Asperse', 'v. t.', 'To sprinkle, as water or dust, upon anybody or\n   anything, or to besprinkle any one with a liquid or with dust.'),
(4263, 'Asperse', 'v. t.', 'To bespatter with foul reports or false and injurious\n   charges; to tarnish in point of reputation or good name; to slander or\n   calumniate; as, to asperse a poet or his writings; to asperse a man\'s\n   character.'),
(4264, 'Aspersed', 'a.', 'Having an indefinite number of small charges scattered or\n   strewed over the surface.'),
(4265, 'Aspersed', 'a.', 'Bespattered; slandered; calumniated.'),
(4266, 'Asperser', 'n.', 'One who asperses; especially, one who vilifies another.'),
(4267, 'Asphalt', 'n.', 'Alt. of Asphaltum'),
(4268, 'Asphalt', 'v. t.', 'To cover with asphalt; as, to asphalt a roof; asphalted\n   streets.'),
(4269, 'Asphalte', 'n.', 'Asphaltic mastic or cement. See Asphalt, 2.'),
(4270, 'Asphodel', 'n.', 'A general name for a plant of the genus Asphodelus. The\n   asphodels are hardy perennial plants, several species of which are\n   cultivated for the beauty of their flowers.'),
(4271, 'Asphyxia', 'n.', 'Alt. of Asphyxy'),
(4272, 'Asphyxy', 'n.', 'Apparent death, or suspended animation; the condition\n   which results from interruption of respiration, as in suffocation or\n   drowning, or the inhalation of irrespirable gases.'),
(4273, 'Aspic', 'n.', 'The venomous asp.'),
(4274, 'Aspic', 'n.', 'A piece of ordnance carrying a 12 pound shot.'),
(4275, 'Aspic', 'n.', 'A European species of lavender (Lavandula spica), which\n   produces a volatile oil. See Spike.'),
(4276, 'Aspic', 'n.', 'A savory meat jelly containing portions of fowl, game, fish,\n   hard boiled eggs, etc.'),
(4277, 'Aspirant', 'a.', 'Aspiring.'),
(4278, 'Aspirant', 'n.', 'One who aspires; one who eagerly seeks some high position\n   or object of attainment.'),
(4279, 'Aspirate', 'v. t.', 'To pronounce with a breathing, an aspirate, or an h\n   sound; as, we aspirate the words horse and house; to aspirate a vowel\n   or a liquid consonant.'),
(4280, 'Aspirate', 'n.', 'A sound consisting of, or characterized by, a breath like\n   the sound of h; the breathing h or a character representing such a\n   sound; an aspirated sound.'),
(4281, 'Aspirate', 'n.', 'A mark of aspiration (/) used in Greek; the asper, or\n   rough breathing.'),
(4282, 'Aspirate', 'n.', 'An elementary sound produced by the breath alone; a surd,\n   or nonvocal consonant; as, f, th in thin, etc.'),
(4283, 'Aspirate', 'a.', 'Alt. of Aspirated'),
(4284, 'Aspired', 'imp. & p. p.', 'of Aspire'),
(4285, 'Aspiring', 'p. pr. & vb. n.', 'of Aspire'),
(4286, 'Aspire', 'v. t.', 'To desire with eagerness; to seek to attain something\n   high or great; to pant; to long; -- followed by to or after, and rarely\n   by at; as, to aspire to a crown; to aspire after immorality.'),
(4287, 'Aspire', 'v. t.', 'To rise; to ascend; to tower; to soar.'),
(4288, 'Aspire', 'v. t.', 'To aspire to; to long for; to try to reach; to mount to.'),
(4289, 'Aspire', 'n.', 'Aspiration.'),
(4290, 'Aspirer', 'n.', 'One who aspires.'),
(4291, 'Aspiring', 'a.', 'That aspires; as, an Aspiring mind.'),
(4292, 'Aspish', 'a.', 'Pertaining to, or like, an asp.'),
(4293, 'Asprawl', 'adv. & a.', 'Sprawling.'),
(4294, 'Asquat', 'adv. & a.', 'Squatting.'),
(4295, 'Asquint', 'adv.', 'With the eye directed to one side; not in the straight\n   line of vision; obliquely; awry, so as to see distortedly; as, to look\n   asquint.'),
(4296, 'Assagai', 'n.', 'Alt. of Assegai'),
(4297, 'Assegai', 'n.', 'A spear used by tribes in South Africa as a missile and\n   for stabbing, a kind of light javelin.'),
(4298, 'Assai', '', 'A direction equivalent to very; as, adagio assai, very slow.'),
(4299, 'Assailed', 'imp. & p. p.', 'of Assail'),
(4300, 'Assail', 'v. t.', 'To attack with violence, or in a vehement and hostile\n   manner; to assault; to molest; as, to assail a man with blows; to\n   assail a city with artillery.'),
(4301, 'Assail', 'v. t.', 'To encounter or meet purposely with the view of\n   mastering, as an obstacle, difficulty, or the like.'),
(4302, 'Assail', 'v. t.', 'To attack morally, or with a view to produce changes in\n   the feelings, character, conduct, existing usages, institutions; to\n   attack by words, hostile influence, etc.; as, to assail one with\n   appeals, arguments, abuse, ridicule, and the like.'),
(4303, 'Assailer', 'n.', 'One who assails.'),
(4304, 'Assamar', 'n.', 'The peculiar bitter substance, soft or liquid, and of a\n   yellow color, produced when meat, bread, gum, sugar, starch, and the\n   like, are roasted till they turn brown.'),
(4305, 'Assamese', 'a.', 'Of or pertaining to Assam, a province of British India,\n   or to its inhabitants.'),
(4306, 'Assamese', 'n. sing. & pl.', 'A native or natives of Assam.'),
(4307, 'Assapan', 'n.', 'Alt. of Assapanic'),
(4308, 'Assart', 'n.', 'The act or offense of grubbing up trees and bushes, and\n   thus destroying the thickets or coverts of a forest.'),
(4309, 'Assart', 'n.', 'A piece of land cleared of trees and bushes, and fitted for\n   cultivation; a clearing.'),
(4310, 'Assart', 'v. t.', 'To grub up, as trees; to commit an assart upon; as, to\n   assart land or trees.'),
(4311, 'Assassin', 'n.', 'One who kills, or attempts to kill, by surprise or secret\n   assault; one who treacherously murders any one unprepared for defense.'),
(4312, 'Assassin', 'v. t.', 'To assassinate.'),
(4313, 'Assault', 'n.', 'A violent onset or attack with physical means, as blows,\n   weapons, etc.; an onslaught; the rush or charge of an attacking force;\n   onset; as, to make assault upon a man, a house, or a town.'),
(4314, 'Assault', 'n.', 'A violent onset or attack with moral weapons, as words,\n   arguments, appeals, and the like; as, to make an assault on the\n   prerogatives of a prince, or on the constitution of a government.'),
(4315, 'Assault', 'n.', 'An apparently violent attempt, or willful offer with force\n   or violence, to do hurt to another; an attempt or offer to beat\n   another, accompanied by a degree of violence, but without touching his\n   person, as by lifting the fist, or a cane, in a threatening manner, or\n   by striking at him, and missing him. If the blow aimed takes effect, it\n   is a battery.'),
(4316, 'Assault', 'n.', 'To make an assault upon, as by a sudden rush of armed men;\n   to attack with unlawful or insulting physical violence or menaces.'),
(4317, 'Assault', 'n.', 'To attack with moral means, or with a view of producing\n   moral effects; to attack by words, arguments, or unfriendly measures;\n   to assail; as, to assault a reputation or an administration.'),
(4318, 'Assay', 'n.', 'Trial; attempt; essay.'),
(4319, 'Assay', 'n.', 'Examination and determination; test; as, an assay of bread\n   or wine.'),
(4320, 'Assay', 'n.', 'Trial by danger or by affliction; adventure; risk; hardship;\n   state of being tried.'),
(4321, 'Assay', 'n.', 'Tested purity or value.'),
(4322, 'Assay', 'n.', 'The act or process of ascertaining the proportion of a\n   particular metal in an ore or alloy; especially, the determination of\n   the proportion of gold or silver in bullion or coin.'),
(4323, 'Assay', 'n.', 'The alloy or metal to be assayed.'),
(4324, 'Assayed', 'imp. & p. p.', 'of Assay'),
(4325, 'Assaying', 'p. pr. & vb. n.', 'of Assay'),
(4326, 'Assay', 'v.', 'To try; to attempt; to apply.'),
(4327, 'Assay', 'v.', 'To affect.'),
(4328, 'Assay', 'v.', 'To try tasting, as food or drink.'),
(4329, 'Assay', 'v.', 'To subject, as an ore, alloy, or other metallic compound, to\n   chemical or metallurgical examination, in order to determine the amount\n   of a particular metal contained in it, or to ascertain its composition.'),
(4330, 'Assay', 'v. i.', 'To attempt, try, or endeavor.'),
(4331, 'Assayer', 'n.', 'One who assays. Specifically: One who examines metallic\n   ores or compounds, for the purpose of determining the amount of any\n   particular metal in the same, especially of gold or silver.'),
(4332, 'Assaying', 'n.', 'The act or process of testing, esp. of analyzing or\n   examining metals and ores, to determine the proportion of pure metal.'),
(4333, 'Assecure', 'v. t.', 'To make sure or safe; to assure.'),
(4334, 'Assegai', 'n.', 'Same as Assagai.'),
(4335, 'Assemble', 'v. t.', 'To collect into one place or body; to bring or call\n   together; to convene; to congregate.'),
(4336, 'Assemble', 'v. i.', 'To meet or come together, as a number of individuals;\n   to convene; to congregate.'),
(4337, 'Assemble', 'v. i.', 'To liken; to compare.'),
(4338, 'Assembly', 'n.', 'A company of persons collected together in one place, and\n   usually for some common purpose, esp. for deliberation and legislation,\n   for worship, or for social entertainment.'),
(4339, 'Assembly', 'n.', 'A collection of inanimate objects.'),
(4340, 'Assembly', 'n.', 'A beat of the drum or sound of the bugle as a signal to\n   troops to assemble.'),
(4341, 'Assented', 'imp. & p. p.', 'of Assent'),
(4342, 'Assent', 'v. t.', 'To admit a thing as true; to express one\'s agreement,\n   acquiescence, concurrence, or concession.'),
(4343, 'Assent', 'v.', 'The act of assenting; the act of the mind in admitting or\n   agreeing to anything; concurrence with approval; consent; agreement;\n   acquiescence.'),
(4344, 'Assenter', 'n.', 'One who assents.'),
(4345, 'Asserted', 'imp. & p. p.', 'of Assert'),
(4346, 'Assert', 'v. t.', 'To affirm; to declare with assurance, or plainly and\n   strongly; to state positively; to aver; to asseverate.'),
(4347, 'Assert', 'v. t.', 'To maintain; to defend.'),
(4348, 'Assert', 'v. t.', 'To maintain or defend, as a cause or a claim, by words\n   or measures; to vindicate a claim or title to; as, to assert our rights\n   and liberties.'),
(4349, 'Asserter', 'n.', 'One who asserts; one who avers pr maintains; an assertor.'),
(4350, 'Assertor', 'n.', 'One who asserts or avers; one who maintains or vindicates\n   a claim or a right; an affirmer, supporter, or vindicator; a defender;\n   an asserter.'),
(4351, 'Assessed', 'imp. & p. p.', 'of Assess'),
(4352, 'Assess', 'v.', 'To value; to make a valuation or official estimate of for\n   the purpose of taxation.'),
(4353, 'Assess', 'v.', 'To apportion a sum to be paid by (a person, a community, or\n   an estate), in the nature of a tax, fine, etc.; to impose a tax upon (a\n   person, an estate, or an income) according to a rate or apportionment.'),
(4354, 'Assess', 'v.', 'To determine and impose a tax or fine upon (a person,\n   community, estate, or income); to tax; as, the club assessed each\n   member twenty-five cents.'),
(4355, 'Assess', 'v.', 'To fix or determine the rate or amount of.'),
(4356, 'Assessee', 'n.', 'One who is assessed.'),
(4357, 'Assessor', 'v.', 'One appointed or elected to assist a judge or magistrate\n   with his special knowledge of the subject to be decided; as legal\n   assessors, nautical assessors.'),
(4358, 'Assessor', 'v.', 'One who sits by another, as next in dignity, or as an\n   assistant and adviser; an associate in office.'),
(4359, 'Assessor', 'v.', 'One appointed to assess persons or property for the\n   purpose of taxation.'),
(4360, 'Asset', 'n.', 'Any article or separable part of one\'s assets.'),
(4361, 'Assets', 'n. pl.', 'Property of a deceased person, subject by law to the\n   payment of his debts and legacies; -- called assets because sufficient\n   to render the executor or administrator liable to the creditors and\n   legatees, so far as such goods or estate may extend.'),
(4362, 'Assets', 'n. pl.', 'Effects of an insolvent debtor or bankrupt, applicable\n   to the payment of debts.'),
(4363, 'Assets', 'n. pl.', 'The entire property of all sorts, belonging to a\n   person, a corporation, or an estate; as, the assets of a merchant or a\n   trading association; -- opposed to liabilities.'),
(4364, 'Assever', 'v. t.', 'See Asseverate.'),
(4365, 'Assidean', 'n.', 'One of a body of devoted Jews who opposed the Hellenistic\n   Jews, and supported the Asmoneans.'),
(4366, 'Assident', 'a.', 'Usually attending a disease, but not always; as, assident\n   signs, or symptoms.'),
(4367, 'Assiege', 'v. t.', 'To besiege.'),
(4368, 'Assiege', 'n.', 'A siege.'),
(4369, 'Assiento', 'n.', 'A contract or convention between Spain and other powers\n   for furnishing negro slaves for the Spanish dominions in America, esp.\n   the contract made with Great Britain in 1713.'),
(4370, 'Assigned', 'imp. & p. p.', 'of Assign'),
(4371, 'Assign', 'v. t.', 'To appoint; to allot; to apportion; to make over.'),
(4372, 'Assign', 'v. t.', 'To fix, specify, select, or designate; to point out\n   authoritatively or exactly; as, to assign a limit; to assign counsel\n   for a prisoner; to assign a day for trial.'),
(4373, 'Assign', 'v. t.', 'To transfer, or make over to another, esp. to transfer\n   to, and vest in, certain persons, called assignees, for the benefit of\n   creditors.'),
(4374, 'Assign', 'v.', 'A thing pertaining or belonging to something else; an\n   appurtenance.'),
(4375, 'Assign', 'n.', 'A person to whom property or an interest is transferred;\n   as, a deed to a man and his heirs and assigns.'),
(4376, 'Assignat', 'n.', 'One of the notes, bills, or bonds, issued as currency by\n   the revolutionary government of France (1790-1796), and based on the\n   security of the lands of the church and of nobles which had been\n   appropriated by the state.'),
(4377, 'Assignee', 'v.', 'A person to whom an assignment is made; a person\n   appointed or deputed by another to do some act, perform some business,\n   or enjoy some right, privilege, or property; as, an assignee of a\n   bankrupt. See Assignment (c). An assignee may be by special appointment\n   or deed, or be created by jaw; as an executor.'),
(4378, 'Assignee', 'v.', 'In England, the persons appointed, under a commission of\n   bankruptcy, to manage the estate of a bankrupt for the benefit of his\n   creditors.'),
(4379, 'Assigner', 'n.', 'One who assigns, appoints, allots, or apportions.'),
(4380, 'Assignor', 'n.', 'An assigner; a person who assigns or transfers an\n   interest; as, the assignor of a debt or other chose in action.'),
(4381, 'Assinego', 'n.', 'See Asinego.'),
(4382, 'Assish', 'a.', 'Resembling an ass; asinine; stupid or obstinate.'),
(4383, 'Assisted', 'imp. & p. p.', 'of Assist'),
(4384, 'Assist', 'v. t.', 'To give support to in some undertaking or effort, or in\n   time of distress; to help; to aid; to succor.'),
(4385, 'Assist', 'v. i.', 'To lend aid; to help.'),
(4386, 'Assist', 'v. i.', 'To be present as a spectator; as, to assist at a public\n   meeting.'),
(4387, 'Assister', 'n.', 'An assistant; a helper.'),
(4388, 'Assistor', 'n.', 'A assister.'),
(4389, 'Assize', 'n.', 'An assembly of knights and other substantial men, with a\n   bailiff or justice, in a certain place and at a certain time, for\n   public business.'),
(4390, 'Assize', 'n.', 'A special kind of jury or inquest.'),
(4391, 'Assize', 'n.', 'A kind of writ or real action.'),
(4392, 'Assize', 'n.', 'A verdict or finding of a jury upon such writ.'),
(4393, 'Assize', 'n.', 'A statute or ordinance in general. Specifically: (1) A\n   statute regulating the weight, measure, and proportions of ingredients\n   and the price of articles sold in the market; as, the assize of bread\n   and other provisions; (2) A statute fixing the standard of weights and\n   measures.'),
(4394, 'Assize', 'n.', 'Anything fixed or reduced to a certainty in point of time,\n   number, quantity, quality, weight, measure, etc.; as, rent of assize.'),
(4395, 'Assize', 'n.', 'A court, the sitting or session of a court, for the trial\n   of processes, whether civil or criminal, by a judge and jury.'),
(4396, 'Assize', 'n.', 'The periodical sessions of the judges of the superior\n   courts in every county of England for the purpose of administering\n   justice in the trial and determination of civil and criminal cases; --\n   usually in the plural.'),
(4397, 'Assize', 'n.', 'The time or place of holding the court of assize; --\n   generally in the plural, assizes.'),
(4398, 'Assize', 'n.', 'Measure; dimension; size.'),
(4399, 'Assized', 'imp. & p. p.', 'of Assize'),
(4400, 'Assizing', 'p. pr. & vb. n.', 'of Assize'),
(4401, 'Assize', 'v.', 'To assess; to value; to rate.'),
(4402, 'Assize', 'v.', 'To fix the weight, measure, or price of, by an ordinance or\n   regulation of authority.'),
(4403, 'Assizer', 'n.', 'An officer who has the care or inspection of weights and\n   measures, etc.'),
(4404, 'Assizor', 'n.', 'A juror.'),
(4405, 'Assober', 'v. t.', 'To make or keep sober.'),
(4406, 'Assoil', 'v. t.', 'To set free; to release.'),
(4407, 'Assoil', 'v. t.', 'To solve; to clear up.'),
(4408, 'Assoil', 'v. t.', 'To set free from guilt; to absolve.'),
(4409, 'Assoil', 'v. t.', 'To expiate; to atone for.'),
(4410, 'Assoil', 'v. t.', 'To remove; to put off.'),
(4411, 'Assoil', 'v. t.', 'To soil; to stain.'),
(4412, 'Assonant', 'a.', 'Having a resemblance of sounds.'),
(4413, 'Assonant', 'a.', 'Pertaining to the peculiar species of rhyme called\n   assonance; not consonant.'),
(4414, 'Assonate', 'v. i.', 'To correspond in sound.'),
(4415, 'Assorted', 'imp. & p. p.', 'of Assort'),
(4416, 'Assort', 'v. t.', 'To separate and distribute into classes, as things of a\n   like kind, nature, or quality, or which are suited to a like purpose;\n   to classify; as, to assort goods. [Rarely applied to persons.]'),
(4417, 'Assort', 'v. t.', 'To furnish with, or make up of, various sorts or a\n   variety of goods; as, to assort a cargo.'),
(4418, 'Assort', 'v. i.', 'To agree; to be in accordance; to be adapted; to suit;\n   to fall into a class or place.'),
(4419, 'Assorted', 'a.', 'Selected; culled.'),
(4420, 'Assot', 'v. t.', 'To besot; to befool; to beguile; to infatuate.'),
(4421, 'Assot', 'a.', 'Dazed; foolish; infatuated.'),
(4422, 'Assuaged', 'imp. & p. p.', 'of Assuage'),
(4423, 'Assuage', 'v. t.', 'To soften, in a figurative sense; to allay, mitigate,\n   ease, or lessen, as heat, pain, or grief; to appease or pacify, as\n   passion or tumult; to satisfy, as appetite or desire.'),
(4424, 'Assuage', 'v. i.', 'To abate or subside.'),
(4425, 'Assuager', 'n.', 'One who, or that which, assuages.'),
(4426, 'Assumed', 'imp. & p. p.', 'of Assume'),
(4427, 'Assuming', 'p. pr. & vb. n.', 'of Assume'),
(4428, 'Assume', 'v. t.', 'To take to or upon one\'s self; to take formally and\n   demonstratively; sometimes, to appropriate or take unjustly.'),
(4429, 'Assume', 'v. t.', 'To take for granted, or without proof; to suppose as a\n   fact; to suppose or take arbitrarily or tentatively.'),
(4430, 'Assume', 'v. t.', 'To pretend to possess; to take in appearance.'),
(4431, 'Assume', 'v. t.', 'To receive or adopt.'),
(4432, 'Assume', 'v. i.', 'To be arrogant or pretentious; to claim more than is\n   due.'),
(4433, 'Assume', 'v. i.', 'To undertake, as by a promise.'),
(4434, 'Assumed', 'a.', 'Supposed.'),
(4435, 'Assumed', 'a.', 'Pretended; hypocritical; make-believe; as, an assumed\n   character.'),
(4436, 'Assument', 'n.', 'A patch; an addition; a piece put on.'),
(4437, 'Assumer', 'n.', 'One who assumes, arrogates, pretends, or supposes.'),
(4438, 'Assuming', 'a.', 'Pretentious; taking much upon one\'s self; presumptuous.'),
(4439, 'Assumpt', 'v. t.', 'To take up; to elevate; to assume.'),
(4440, 'Assumpt', 'n.', 'That which is assumed; an assumption.'),
(4441, 'Assured', 'imp. & p. p.', 'of Assure'),
(4442, 'Assuring', 'p. pr. & vb. n.', 'of Assure'),
(4443, 'Assure', 'v. t.', 'To make sure or certain; to render confident by a\n   promise, declaration, or other evidence.'),
(4444, 'Assure', 'v. t.', 'To declare to, solemnly; to assert to (any one) with the\n   design of inspiring belief or confidence.'),
(4445, 'Assure', 'v. t.', 'To confirm; to make certain or secure.'),
(4446, 'Assure', 'v. t.', 'To affiance; to betroth.'),
(4447, 'Assure', 'v. t.', 'To insure; to covenant to indemnify for loss, or to pay\n   a specified sum at death. See Insure.'),
(4448, 'Assured', 'a.', 'Made sure; safe; insured; certain; indubitable; not\n   doubting; bold to excess.'),
(4449, 'Assured', 'n.', 'One whose life or property is insured.'),
(4450, 'Assurer', 'n.', 'One who assures. Specifically: One who insures against\n   loss; an insurer or underwriter.'),
(4451, 'Assurer', 'n.', 'One who takes out a life assurance policy.'),
(4452, 'Assuring', 'a.', 'That assures; tending to assure; giving confidence.'),
(4453, 'Asswage', 'v.', 'See Assuage.'),
(4454, 'Assyrian', 'a.', 'Of or pertaining to Assyria, or to its inhabitants.'),
(4455, 'Assyrian', 'n.', 'A native or an inhabitant of Assyria; the language of\n   Assyria.'),
(4456, 'Astacus', 'n.', 'A genus of crustaceans, containing the crawfish of\n   fresh-water lobster of Europe, and allied species of western North\n   America. See Crawfish.'),
(4457, 'Astart', 'v. t. & i.', 'Same as Astert.'),
(4458, 'Astarte', 'n.', 'A genus of bivalve mollusks, common on the coasts of\n   America and Europe.'),
(4459, 'Astate', 'n.', 'Estate; state.'),
(4460, 'Astatic', 'a.', 'Having little or no tendency to take a fixed or definite\n   position or direction: thus, a suspended magnetic needle, when rendered\n   astatic, loses its polarity, or tendency to point in a given direction.'),
(4461, 'Astay', 'adv.', 'An anchor is said to be astay, when, in heaving it, an\n   acute angle is formed between the cable and the surface of the water.'),
(4462, 'Asteism', 'n.', 'Genteel irony; a polite and ingenious manner of deriding\n   another.'),
(4463, 'Astel', 'n.', 'An arch, or ceiling, of boards, placed over the men\'s heads\n   in a mine.'),
(4464, 'Aster', 'n.', 'A genus of herbs with compound white or bluish flowers;\n   starwort; Michaelmas daisy.'),
(4465, 'Aster', 'n.', 'A plant of the genus Callistephus. Many varieties (called\n   China asters, German asters, etc.) are cultivated for their handsome\n   compound flowers.'),
(4466, 'Asterias', 'n.', 'A genus of echinoderms.'),
(4467, 'Asterion', 'n.', 'The point on the side of the skull where the lambdoid,\n   parieto-mastoid and occipito-mastoid sutures.'),
(4468, 'Asterisk', 'n.', 'The figure of a star, thus, /, used in printing and\n   writing as a reference to a passage or note in the margin, to supply\n   the omission of letters or words, or to mark a word or phrase as having\n   a special character.'),
(4469, 'Asterism', 'n.', 'A constellation.'),
(4470, 'Asterism', 'n.', 'A small cluster of stars.'),
(4471, 'Asterism', 'n.', 'An asterisk, or mark of reference.'),
(4472, 'Asterism', 'n.', 'Three asterisks placed in this manner, /, to direct\n   attention to a particular passage.'),
(4473, 'Asterism', 'n.', 'An optical property of some crystals which exhibit a\n   star-shaped by reflected light, as star sapphire, or by transmitted\n   light, as some mica.'),
(4474, 'Astern', 'adv.', 'In or at the hinder part of a ship; toward the hinder\n   part, or stern; backward; as, to go astern.'),
(4475, 'Astern', 'adv.', 'Behind a ship; in the rear.'),
(4476, 'Asternal', 'a.', 'Not sternal; -- said of ribs which do not join the\n   sternum.'),
(4477, 'Asteroid', 'n.', 'A starlike body; esp. one of the numerous small planets\n   whose orbits lie between those of Mars and Jupiter; -- called also\n   planetoids and minor planets.'),
(4478, 'Astert', 'v. t.', 'To start up; to befall; to escape; to shun.'),
(4479, 'Astert', 'v. i.', 'To escape.'),
(4480, 'Asthenia', 'n.', 'Alt. of Astheny'),
(4481, 'Astheny', 'n.', 'Want or loss of strength; debility; diminution of the\n   vital forces.'),
(4482, 'Asthenic', 'a.', 'Characterized by, or pertaining to, debility; weak;\n   debilitating.'),
(4483, 'Asthma', 'n.', 'A disease, characterized by difficulty of breathing (due to\n   a spasmodic contraction of the bronchi), recurring at intervals,\n   accompanied with a wheezing sound, a sense of constriction in the\n   chest, a cough, and expectoration.'),
(4484, 'Astir', 'adv. & a.', 'Stirring; in a state of activity or motion; out of\n   bed.'),
(4485, 'Astomous', 'a.', 'Not possessing a mouth.'),
(4486, 'Astoned', 'imp. & p. p.', 'of Astone'),
(4487, 'Astond', '', 'of Astone'),
(4488, 'Astound', '', 'of Astone'),
(4489, 'Aston', 'v. t.', 'Alt. of Astone'),
(4490, 'Astone', 'v. t.', 'To stun; to astonish; to stupefy.'),
(4491, 'Astonied', 'p. p.', 'Stunned; astonished. See Astony.'),
(4492, 'Astonish', 'v. t.', 'To stun; to render senseless, as by a blow.'),
(4493, 'Astonish', 'v. t.', 'To strike with sudden fear, terror, or wonder; to\n   amaze; to surprise greatly, as with something unaccountable; to\n   confound with some sudden emotion or passion.'),
(4494, 'Astonied', 'imp. & p. p.', 'of Astony'),
(4495, 'Astony', 'v. t.', 'To stun; to bewilder; to astonish; to dismay.'),
(4496, 'Astoop', 'adv.', 'In a stooping or inclined position.'),
(4497, 'Astound', 'a.', 'Stunned; astounded; astonished.'),
(4498, 'Astound', '', 'of Astound'),
(4499, 'Astound', 'a.', 'To stun; to stupefy.'),
(4500, 'Astound', 'a.', 'To astonish; to strike with amazement; to confound with\n   wonder, surprise, or fear.'),
(4501, 'Astraean', 'a.', 'Pertaining to the genus Astraea or the family Astraeidae.'),
(4502, 'Astraean', 'n.', 'A coral of the family Astraeidae; a star coral.'),
(4503, 'Astragal', 'n.', 'A convex molding of rounded surface, generally from half\n   to three quarters of a circle.'),
(4504, 'Astragal', 'n.', 'A round molding encircling a cannon near the mouth.'),
(4505, 'Astral', 'a.', 'Pertaining to, coming from, or resembling, the stars;\n   starry; starlike.'),
(4506, 'Astrand', 'adv. & a.', 'Stranded.'),
(4507, 'Astray', 'adv. & a.', 'Out of the right, either in a literal or in a\n   figurative sense; wandering; as, to lead one astray.'),
(4508, 'Astrict', 'v. t.', 'To bind up; to confine; to constrict; to contract.'),
(4509, 'Astrict', 'v. t.', 'To bind; to constrain; to restrict; to limit.'),
(4510, 'Astrict', 'v. t.', 'To restrict the tenure of; as, to astrict lands. See\n   Astriction, 4.'),
(4511, 'Astrict', 'a.', 'Concise; contracted.'),
(4512, 'Astride', 'adv.', 'With one leg on each side, as a man when on horseback;\n   with the legs stretched wide apart; astraddle.'),
(4513, 'Astringe', 'v. t.', 'To bind fast; to constrict; to contract; to cause\n   parts to draw together; to compress.'),
(4514, 'Astringe', 'v. t.', 'To bind by moral or legal obligation.'),
(4515, 'Astro-', '', 'The combining form of the Greek word \'a`stron, meaning star.'),
(4516, 'Astrofel', 'n.', 'Alt. of Astrofell'),
(4517, 'Astroite', 'n.', 'A radiated stone or fossil; star-stone.'),
(4518, 'Astrut', 'a. & adv.', 'Sticking out, or puffed out; swelling; in a swelling\n   manner.'),
(4519, 'Astrut', 'a. & adv.', 'In a strutting manner; with a strutting gait.'),
(4520, 'Astucity', 'n.', 'Craftiness; astuteness.'),
(4521, 'Astun', 'v. t.', 'To stun.'),
(4522, 'Asturian', 'a.', 'Of or pertaining to Asturias in Spain.'),
(4523, 'Asturian', 'n.', 'A native of Asturias.'),
(4524, 'Astute', 'a.', 'Critically discerning; sagacious; shrewd; subtle; crafty.'),
(4525, 'Astylar', 'a.', 'Without columns or pilasters.'),
(4526, 'Astyllen', 'n.', 'A small dam to prevent free passage of water in an adit\n   or level.'),
(4527, 'Asunder', 'adv.', 'Apart; separate from each other; into parts; in two;\n   separately; into or in different pieces or places.'),
(4528, 'Asura', 'n.', 'An enemy of the gods, esp. one of a race of demons and\n   giants.'),
(4529, 'Aswail', 'n.', 'The sloth bear (Melursus labiatus) of India.'),
(4530, 'Asweve', 'v. t.', 'To stupefy.'),
(4531, 'Aswing', 'adv.', 'In a state of swinging.'),
(4532, 'Aswoon', 'adv.', 'In a swoon.'),
(4533, 'Aswooned', 'adv.', 'In a swoon.'),
(4534, 'Asylums', 'pl. ', 'of Asylum'),
(4535, 'Asyla', 'pl. ', 'of Asylum'),
(4536, 'Asylum', 'n.', 'A sanctuary or place of refuge and protection, where\n   criminals and debtors found shelter, and from which they could not be\n   forcibly taken without sacrilege.'),
(4537, 'Asylum', 'n.', 'Any place of retreat and security.'),
(4538, 'Asylum', 'n.', 'An institution for the protection or relief of some class\n   of destitute, unfortunate, or afflicted persons; as, an asylum for the\n   aged, for the blind, or for the insane; a lunatic asylum; an orphan\n   asylum.'),
(4539, 'Asystole', 'n.', 'A weakening or cessation of the contractile power of the\n   heart.'),
(4540, 'Atabal', 'n.', 'A kettledrum; a kind of tabor, used by the Moors.'),
(4541, 'Atafter', 'prep.', 'After.'),
(4542, 'Ataghan', 'n.', 'See Yataghan.'),
(4543, 'Atake', 'v. t.', 'To overtake.'),
(4544, 'Ataman', 'n.', 'A hetman, or chief of the Cossacks.'),
(4545, 'Ataraxia', 'n.', 'Alt. of Ataraxy'),
(4546, 'Ataraxy', 'n.', 'Perfect peace of mind, or calmness.'),
(4547, 'Ataunt', 'adv.', 'Alt. of Ataunto'),
(4548, 'Ataunto', 'adv.', 'Fully rigged, as a vessel; with all sails set; set on\n   end or set right.'),
(4549, 'Atavic', 'a.', 'Pertaining to a remote ancestor, or to atavism.'),
(4550, 'Atavism', 'n.', 'The recurrence, or a tendency to a recurrence, of the\n   original type of a species in the progeny of its varieties; resemblance\n   to remote rather than to near ancestors; reversion to the original\n   form.'),
(4551, 'Atavism', 'n.', 'The recurrence of any peculiarity or disease of an\n   ancestor in a subsequent generation, after an intermission for a\n   generation or two.'),
(4552, 'Ataxia', 'n.', 'Alt. of Ataxy'),
(4553, 'Ataxy', 'n.', 'Disorder; irregularity.'),
(4554, 'Ataxy', 'n.', 'Irregularity in disease, or in the functions.'),
(4555, 'Ataxy', 'n.', 'The state of disorder that characterizes nervous fevers and\n   the nervous condition.'),
(4556, 'Ataxic', 'a.', 'Characterized by ataxy, that is, (a) by great irregularity\n   of functions or symptoms, or (b) by a want of coordinating power in\n   movements.'),
(4557, 'Atazir', 'n.', 'The influence of a star upon other stars or upon men.'),
(4558, 'Atechnic', 'a.', 'Without technical or artistic knowledge.'),
(4559, 'Ateles', 'n.', 'A genus of American monkeys with prehensile tails, and\n   having the thumb wanting or rudimentary. See Spider monkey, and Coaita.'),
(4560, 'Atelier', 'n.', 'A workshop; a studio.'),
(4561, 'Atellan', 'a.', 'Of or pertaining to Atella, in ancient Italy; as, Atellan\n   plays; farcical; ribald.'),
(4562, 'Atellan', 'n.', 'A farcical drama performed at Atella.'),
(4563, 'Athanor', 'n.', 'A digesting furnace, formerly used by alchemists. It was\n   so constructed as to maintain uniform and durable heat.'),
(4564, 'Athecata', 'n. pl.', 'A division of Hydroidea in which the zooids are\n   naked, or not inclosed in a capsule. See Tubularian.'),
(4565, 'Atheism', 'n.', 'The disbelief or denial of the existence of a God, or\n   supreme intelligent Being.'),
(4566, 'Atheism', 'n.', 'Godlessness.'),
(4567, 'Atheist', 'n.', 'One who disbelieves or denies the existence of a God, or\n   supreme intelligent Being.'),
(4568, 'Atheist', 'n.', 'A godless person.'),
(4569, 'Atheize', 'v. t.', 'To render atheistic or godless.'),
(4570, 'Atheize', 'v. i.', 'To discourse, argue, or act as an atheist.'),
(4571, 'Atheling', 'n.', 'An Anglo-Saxon prince or nobleman; esp., the heir\n   apparent or a prince of the royal family.'),
(4572, 'Athenaea', 'pl. ', 'of Athenaeum'),
(4573, 'Atheneum', 'n.', 'Alt. of Athenaeum'),
(4574, 'Athenian', 'a.', 'Of or pertaining to Athens, the metropolis of Greece.'),
(4575, 'Athenian', 'n.', 'A native or citizen of Athens.'),
(4576, 'Atheous', 'a.', 'Atheistic; impious.'),
(4577, 'Atheous', 'a.', 'Without God, neither accepting nor denying him.'),
(4578, 'Atherine', 'n.', 'A small marine fish of the family Atherinidae, having a\n   silvery stripe along the sides. The European species (Atherina\n   presbyter) is used as food. The American species (Menidia notata) is\n   called silversides and sand smelt. See Silversides.'),
(4579, 'Atheroid', 'a.', 'Shaped like an ear of grain.'),
(4580, 'Atheroma', 'n.', 'An encysted tumor containing curdy matter.'),
(4581, 'Atheroma', 'n.', 'A disease characterized by thickening and fatty\n   degeneration of the inner coat of the arteries.'),
(4582, 'Athink', 'v. t.', 'To repent; to displease; to disgust.'),
(4583, 'Athirst', 'a.', 'Wanting drink; thirsty.'),
(4584, 'Athirst', 'a.', 'Having a keen appetite or desire; eager; longing.'),
(4585, 'Athlete', 'n.', 'One who contended for a prize in the public games of\n   ancient Greece or Rome.'),
(4586, 'Athlete', 'n.', 'Any one trained to contend in exercises requiring great\n   physical agility and strength; one who has great activity and strength;\n   a champion.'),
(4587, 'Athlete', 'n.', 'One fitted for, or skilled in, intellectual contests; as,\n   athletes of debate.'),
(4588, 'Athletic', 'a.', 'Of or pertaining to athletes or to the exercises\n   practiced by them; as, athletic games or sports.'),
(4589, 'Athletic', 'a.', 'Befitting an athlete; strong; muscular; robust; vigorous;\n   as, athletic Celts.'),
(4590, 'Athwart', 'prep.', 'Across; from side to side of.'),
(4591, 'Athwart', 'prep.', 'Across the direction or course of; as, a fleet standing\n   athwart our course.'),
(4592, 'Athwart', 'adv.', 'Across, especially in an oblique direction; sidewise;\n   obliquely.'),
(4593, 'Athwart', 'adv.', 'Across the course; so as to thwart; perversely.'),
(4594, 'Atilt', 'adv.', 'In the manner of a tilter; in the position, or with the\n   action, of one making a thrust.'),
(4595, 'Atilt', 'adv.', 'In the position of a cask tilted, or with one end raised.\n   [In this sense sometimes used as an adjective.]'),
(4596, 'Atimy', 'n.', 'Public disgrace or stigma; infamy; loss of civil rights.'),
(4597, '-ation', '', 'A suffix forming nouns of action, and often equivalent to the\n   verbal substantive in -ing. It sometimes has the further meanings of\n   state, and that which results from the action. Many of these nouns have\n   verbs in -ate; as, alliterate -ation, narrate -ation; many are derived\n   through the French; as, alteration, visitation; and many are formed on\n   verbs ending in the Greek formative -ize (Fr. -ise); as, civilization,\n   demoralization.'),
(4598, 'A-tiptoe', 'adv.', 'On tiptoe; eagerly expecting.'),
(4599, 'Atlanta', 'n.', 'A genus of small glassy heteropod mollusks found swimming\n   at the surface in mid ocean. See Heteropod.'),
(4600, 'Atlantal', 'a.', 'Relating to the atlas.'),
(4601, 'Atlantal', 'a.', 'Anterior; cephalic.'),
(4602, 'Atlantes', 'n. pl.', 'Figures or half figures of men, used as columns to\n   support an entablature; -- called also telamones. See Caryatides.'),
(4603, 'Atlantic', 'a.', 'Of or pertaining to Mt. Atlas in Libya, and hence applied\n   to the ocean which lies between Europe and Africa on the east and\n   America on the west; as, the Atlantic Ocean (called also the Atlantic);\n   the Atlantic basin; the Atlantic telegraph.'),
(4604, 'Atlantic', 'a.', 'Of or pertaining to the isle of Atlantis.'),
(4605, 'Atlantic', 'a.', 'Descended from Atlas.'),
(4606, 'Atlases', 'pl. ', 'of Atlas'),
(4607, 'Atlas', 'n.', 'One who sustains a great burden.'),
(4608, 'Atlas', 'n.', 'The first vertebra of the neck, articulating immediately\n   with the skull, thus sustaining the globe of the head, whence the name.'),
(4609, 'Atlas', 'n.', 'A collection of maps in a volume'),
(4610, 'Atlas', 'n.', 'A volume of plates illustrating any subject.'),
(4611, 'Atlas', 'n.', 'A work in which subjects are exhibited in a tabular from or\n   arrangement; as, an historical atlas.'),
(4612, 'Atlas', 'n.', 'A large, square folio, resembling a volume of maps; --\n   called also atlas folio.'),
(4613, 'Atlas', 'n.', 'A drawing paper of large size. See under Paper, n.'),
(4614, 'Atlas', 'n.', 'A rich kind of satin manufactured in India.'),
(4615, 'Atmology', 'n.', 'That branch of science which treats of the laws and\n   phenomena of aqueous vapor.'),
(4616, 'Atmolyze', 'v. t.', 'To subject to atmolysis; to separate by atmolysis.'),
(4617, 'Atokous', 'a.', 'Producing only asexual individuals, as the eggs of certain\n   annelids.'),
(4618, 'Atoll', 'n.', 'A coral island or islands, consisting of a belt of coral\n   reef, partly submerged, surrounding a central lagoon or depression; a\n   lagoon island.'),
(4619, 'Atomic', 'a.', 'Alt. of Atomical'),
(4620, 'Atomical', 'a.', 'Of or pertaining to atoms.'),
(4621, 'Atomical', 'a.', 'Extremely minute; tiny.'),
(4622, 'Atomism', 'n.', 'The doctrine of atoms. See Atomic philosophy, under\n   Atomic.'),
(4623, 'Atomist', 'n.', 'One who holds to the atomic philosophy or theory.'),
(4624, 'Atomize', 'v. t.', 'To reduce to atoms, or to fine spray.'),
(4625, 'Atomizer', 'n.', 'One who, or that which, atomizes; esp., an instrument for\n   reducing a liquid to spray for disinfecting, cooling, or perfuming.'),
(4626, 'Atomy', 'n.', 'An atom; a mite; a pigmy.'),
(4627, 'Atomy', 'n.', 'A skeleton.'),
(4628, 'Atonable', 'a.', 'Admitting an atonement; capable of being atoned for;\n   expiable.'),
(4629, 'At one', '', 'In concord or friendship; in agreement (with each other); as,\n   to be, bring, make, or set, at one, i. e., to be or bring in or to a\n   state of agreement or reconciliation.'),
(4630, 'At one', '', 'Of the same opinion; agreed; as, on these points we are at\n   one.'),
(4631, 'At one', '', 'Together.'),
(4632, 'Atoned', 'imp. & p. p.', 'of Atone'),
(4633, 'Atoning', 'p. pr. & vb. n.', 'of Atone'),
(4634, 'Atone', 'v. i.', 'To agree; to be in accordance; to accord.'),
(4635, 'Atone', 'v. i.', 'To stand as an equivalent; to make reparation,\n   compensation, or amends, for an offense or a crime.'),
(4636, 'Atone', 'v. t.', 'To set at one; to reduce to concord; to reconcile, as\n   parties at variance; to appease.'),
(4637, 'Atone', 'v. t.', 'To unite in making.'),
(4638, 'Atone', 'v. t.', 'To make satisfaction for; to expiate.'),
(4639, 'Atoner', 'n.', 'One who makes atonement.'),
(4640, 'Atonic', 'a.', 'Characterized by atony, or want of vital energy; as, an\n   atonic disease.'),
(4641, 'Atonic', 'a.', 'Unaccented; as, an atonic syllable.'),
(4642, 'Atonic', 'a.', 'Destitute of tone vocality; surd.'),
(4643, 'Atonic', 'n.', 'A word that has no accent.'),
(4644, 'Atonic', 'n.', 'An element of speech entirely destitute of vocality, or\n   produced by the breath alone; a nonvocal or surd consonant; a\n   breathing.'),
(4645, 'Atonic', 'n.', 'A remedy capable of allaying organic excitement or\n   irritation.'),
(4646, 'Atony', 'n.', 'Want of tone; weakness of the system, or of any organ,\n   especially of such as are contractile.'),
(4647, 'Atrede', 'v. t.', 'To surpass in council.'),
(4648, 'Atrenne', 'v. t.', 'To outrun.'),
(4649, 'Atresia', 'n.', 'Absence or closure of a natural passage or channel of the\n   body; imperforation.'),
(4650, 'Atrial', 'a.', 'Of or pertaining to an atrium.'),
(4651, 'Atrip', 'adv.', 'Just hove clear of the ground; -- said of the anchor.'),
(4652, 'Atrip', 'adv.', 'Sheeted home, hoisted taut up and ready for trimming; --\n   said of sails.'),
(4653, 'Atrip', 'adv.', 'Hoisted up and ready to be swayed across; -- said of\n   yards.'),
(4654, 'Atria', 'pl. ', 'of Atrium'),
(4655, 'Atrium', 'n.', 'A square hall lighted from above, into which rooms open at\n   one or more levels.'),
(4656, 'Atrium', 'n.', 'An open court with a porch or gallery around three or more\n   sides; especially at the entrance of a basilica or other church. The\n   name was extended in the Middle Ages to the open churchyard or\n   cemetery.'),
(4657, 'Atrium', 'n.', 'The main part of either auricle of the heart as distinct\n   from the auricular appendix. Also, the whole articular portion of the\n   heart.'),
(4658, 'Atrium', 'n.', 'A cavity in ascidians into which the intestine and\n   generative ducts open, and which also receives the water from the\n   gills. See Ascidioidea.'),
(4659, 'Atrocha', 'n.', 'A kind of chaetopod larva in which no circles of cilia are\n   developed.'),
(4660, 'Atrocity', 'n.', 'Enormous wickedness; extreme heinousness or cruelty.'),
(4661, 'Atrocity', 'n.', 'An atrocious or extremely cruel deed.'),
(4662, 'Atrophic', 'a.', 'Relating to atrophy.'),
(4663, 'Atrophy', 'n.', 'A wasting away from want of nourishment; diminution in\n   bulk or slow emaciation of the body or of any part.'),
(4664, 'Atrophy', 'v. t.', 'To cause to waste away or become abortive; to starve or\n   weaken.'),
(4665, 'Atrophy', 'v. i.', 'To waste away; to dwindle.'),
(4666, 'Atropia', 'n.', 'Same as Atropine.'),
(4667, 'Atropine', 'n.', 'A poisonous, white, crystallizable alkaloid, extracted\n   from the Atropa belladonna, or deadly nightshade, and the Datura\n   Stramonium, or thorn apple. It is remarkable for its power in dilating\n   the pupil of the eye. Called also daturine.'),
(4668, 'Atropism', 'n.', 'A condition of the system produced by long use of\n   belladonna.'),
(4669, 'Atropous', 'a.', 'Not inverted; orthotropous.'),
(4670, 'Atrous', 'a.', 'Coal-black; very black.'),
(4671, 'Atrypa', 'n.', 'A extinct genus of Branchiopoda, very common in Silurian\n   limestones.'),
(4672, 'Attabal', 'n.', 'See Atabal.'),
(4673, 'Attacca', '', 'Attack at once; -- a direction at the end of a movement to\n   show that the next is to follow immediately, without any pause.'),
(4674, 'Attached', 'imp. & p. p.', 'of Attach'),
(4675, 'Attach', 'v. t.', 'To bind, fasten, tie, or connect; to make fast or join;\n   as, to attach one thing to another by a string, by glue, or the like.'),
(4676, 'Attach', 'v. t.', 'To connect; to place so as to belong; to assign by\n   authority; to appoint; as, an officer is attached to a certain\n   regiment, company, or ship.'),
(4677, 'Attach', 'v. t.', 'To win the heart of; to connect by ties of love or\n   self-interest; to attract; to fasten or bind by moral influence; --\n   with to; as, attached to a friend; attaching others to us by wealth or\n   flattery.'),
(4678, 'Attach', 'v. t.', 'To connect, in a figurative sense; to ascribe or\n   attribute; to affix; -- with to; as, to attach great importance to a\n   particular circumstance.'),
(4679, 'Attach', 'v. t.', 'To take, seize, or lay hold of.'),
(4680, 'Attach', 'v. t.', 'To take by legal authority: (a) To arrest by writ, and\n   bring before a court, as to answer for a debt, or a contempt; --\n   applied to a taking of the person by a civil process; being now rarely\n   used for the arrest of a criminal. (b) To seize or take (goods or real\n   estate) by virtue of a writ or precept to hold the same to satisfy a\n   judgment which may be rendered in the suit. See Attachment, 4.'),
(4681, 'Attach', 'v. i.', 'To adhere; to be attached.'),
(4682, 'Attach', 'v. i.', 'To come into legal operation in connection with\n   anything; to vest; as, dower will attach.'),
(4683, 'Attach', 'n.', 'An attachment.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(4684, 'Attache', 'v. t.', 'One attached to another person or thing, as a part of a\n   suite or staff. Specifically: One attached to an embassy.'),
(4685, 'Attacked', 'imp. & p. p.', 'of Attack'),
(4686, 'Attack', 'v. t.', 'To fall upon with force; to assail, as with force and\n   arms; to assault.'),
(4687, 'Attack', 'v. t.', 'To assail with unfriendly speech or writing; to begin a\n   controversy with; to attempt to overthrow or bring into disrepute, by\n   criticism or satire; to censure; as, to attack a man, or his opinions,\n   in a pamphlet.'),
(4688, 'Attack', 'v. t.', 'To set to work upon, as upon a task or problem, or some\n   object of labor or investigation.'),
(4689, 'Attack', 'v. t.', 'To begin to affect; to begin to act upon, injuriously or\n   destructively; to begin to decompose or waste.'),
(4690, 'Attack', 'v. i.', 'To make an onset or attack.'),
(4691, 'Attack', 'n.', 'The act of attacking, or falling on with force or violence;\n   an onset; an assault; -- opposed to defense.'),
(4692, 'Attack', 'n.', 'An assault upon one\'s feelings or reputation with\n   unfriendly or bitter words.'),
(4693, 'Attack', 'n.', 'A setting to work upon some task, etc.'),
(4694, 'Attack', 'n.', 'An access of disease; a fit of sickness.'),
(4695, 'Attack', 'n.', 'The beginning of corrosive, decomposing, or destructive\n   action, by a chemical agent.'),
(4696, 'Attacker', 'n.', 'One who attacks.'),
(4697, 'Attagas', 'n.', 'Alt. of Attagen'),
(4698, 'Attagen', 'n.', 'A species of sand grouse (Syrrghaptes Pallasii) found in\n   Asia and rarely in southern Europe.'),
(4699, 'Attaghan', 'n.', 'See Yataghan.'),
(4700, 'Attained', 'imp. & p. p.', 'of Attain'),
(4701, 'Attain', 'v. t.', 'To achieve or accomplish, that is, to reach by efforts;\n   to gain; to compass; as, to attain rest.'),
(4702, 'Attain', 'v. t.', 'To gain or obtain possession of; to acquire.'),
(4703, 'Attain', 'v. t.', 'To get at the knowledge of; to ascertain.'),
(4704, 'Attain', 'v. t.', 'To reach or come to, by progression or motion; to arrive\n   at.'),
(4705, 'Attain', 'v. t.', 'To overtake.'),
(4706, 'Attain', 'v. t.', 'To reach in excellence or degree; to equal.'),
(4707, 'Attain', 'v. i.', 'To come or arrive, by motion, growth, bodily exertion,\n   or efforts toward a place, object, state, etc.; to reach.'),
(4708, 'Attain', 'v. i.', 'To come or arrive, by an effort of mind.'),
(4709, 'Attain', 'n.', 'Attainment.'),
(4710, 'Attaint', 'v. t.', 'To attain; to get act; to hit.'),
(4711, 'Attaint', 'v. t.', 'To find guilty; to convict; -- said esp. of a jury on\n   trial for giving a false verdict.'),
(4712, 'Attaint', 'v. t.', 'To subject (a person) to the legal condition formerly\n   resulting from a sentence of death or outlawry, pronounced in respect\n   of treason or felony; to affect by attainder.'),
(4713, 'Attaint', 'v. t.', 'To accuse; to charge with a crime or a dishonorable\n   act.'),
(4714, 'Attaint', 'v. t.', 'To affect or infect, as with physical or mental disease\n   or with moral contagion; to taint or corrupt.'),
(4715, 'Attaint', 'v. t.', 'To stain; to obscure; to sully; to disgrace; to cloud\n   with infamy.'),
(4716, 'Attaint', 'p. p.', 'Attainted; corrupted.'),
(4717, 'Attaint', 'v.', 'A touch or hit.'),
(4718, 'Attaint', 'v.', 'A blow or wound on the leg of a horse, made by\n   overreaching.'),
(4719, 'Attaint', 'v.', 'A writ which lies after judgment, to inquire whether a\n   jury has given a false verdict in any court of record; also, the\n   convicting of the jury so tried.'),
(4720, 'Attaint', 'v.', 'A stain or taint; disgrace. See Taint.'),
(4721, 'Attaint', 'v.', 'An infecting influence.'),
(4722, 'Attal', 'n.', 'Same as Attle.'),
(4723, 'Attame', 'v. t.', 'To pierce; to attack.'),
(4724, 'Attame', 'v. t.', 'To broach; to begin.'),
(4725, 'Attar', 'n.', 'A fragrant essential oil; esp., a volatile and highly\n   fragrant essential oil obtained from the petals of roses.'),
(4726, 'Attask', 'v. t.', 'To take to task; to blame.'),
(4727, 'Attaste', 'v. t.', 'To taste or cause to taste.'),
(4728, 'Attemper', 'v. t.', 'To reduce, modify, or moderate, by mixture; to temper;\n   to regulate, as temperature.'),
(4729, 'Attemper', 'v. t.', 'To soften, mollify, or moderate; to soothe; to temper;\n   as, to attemper rigid justice with clemency.'),
(4730, 'Attemper', 'v. t.', 'To mix in just proportion; to regulate; as, a mind\n   well attempered with kindness and justice.'),
(4731, 'Attemper', 'v. t.', 'To accommodate; to make suitable; to adapt.'),
(4732, 'Attempt', 'v. t.', 'To make trial or experiment of; to try; to endeavor to\n   do or perform (some action); to assay; as, to attempt to sing; to\n   attempt a bold flight.'),
(4733, 'Attempt', 'v. t.', 'To try to move, by entreaty, by afflictions, or by\n   temptations; to tempt.'),
(4734, 'Attempt', 'v. t.', 'To try to win, subdue, or overcome; as, one who\n   attempts the virtue of a woman.'),
(4735, 'Attempt', 'v. t.', 'To attack; to make an effort or attack upon; to try to\n   take by force; as, to attempt the enemy\'s camp.'),
(4736, 'Attempt', 'v. i.', 'To make an attempt; -- with upon.'),
(4737, 'Attempt', 'n.', 'A essay, trial, or endeavor; an undertaking; an attack, or\n   an effort to gain a point; esp. an unsuccessful, as contrasted with a\n   successful, effort.'),
(4738, 'Attended', 'imp. & p. p.', 'of Attend'),
(4739, 'Attend', 'v. t.', 'To direct the attention to; to fix the mind upon; to\n   give heed to; to regard.'),
(4740, 'Attend', 'v. t.', 'To care for; to look after; to take charge of; to watch\n   over.'),
