(5227, 'Awlwort', 'n.', 'A plant (Subularia aquatica), with awl-shaped leaves.'),
(5228, 'Awned', 'a.', 'Furnished with an awn, or long bristle-shaped tip; bearded.'),
(5229, 'Awning', 'n.', 'A rooflike cover, usually of canvas, extended over or\n   before any place as a shelter from the sun, rain, or wind.'),
(5230, 'Awning', 'n.', 'That part of the poop deck which is continued forward\n   beyond the bulkhead of the cabin.'),
(5231, 'Awninged', 'a.', 'Furnished with an awning.'),
(5232, 'Awnless', 'a.', 'Without awns or beard.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(5233, 'Awork', 'adv.', 'At work; in action.'),
(5234, 'Aworking', 'adv.', 'At work; in action.'),
(5235, 'Awreak', 'v. t. & i.', 'Alt. of Awreke'),
(5236, 'Awreke', 'v. t. & i.', 'To avenge. [Obs.] See Wreak.'),
(5237, 'Awrong', 'adv.', 'Wrongly.'),
(5238, 'Awsome', 'a.', 'Same as Awesome.'),
(5239, 'Axeman', '', 'See Ax, Axman.'),
(5240, 'Axial', 'a.', 'Of or pertaining to an axis; of the nature of, or\n   resembling, an axis; around an axis.'),
(5241, 'Axial', 'a.', 'Belonging to the axis of the body; as, the axial skeleton;\n   or to the axis of any appendage or organ; as, the axial bones.'),
(5242, 'Axially', 'adv.', 'In relation to, or in a line with, an axis; in the axial\n   (magnetic) line.'),
(5243, 'Axile', 'a.', 'Situated in the axis of anything; as an embryo which lies in\n   the axis of a seed.'),
(5244, 'Axillae', 'pl. ', 'of Axilla'),
(5245, 'Axilla', 'n.', 'The armpit, or the cavity beneath the junction of the arm\n   and shoulder.'),
(5246, 'Axilla', 'n.', 'An axil.'),
(5247, 'Axillar', 'a.', 'Axillary.'),
(5248, 'Axillars', 'n. pl.', 'Feathers connecting the under surface of the wing and\n   the body, and concealed by the closed wing.'),
(5249, 'Axillary', 'a.', 'Of or pertaining to the axilla or armpit; as, axillary\n   gland, artery, nerve.'),
(5250, 'Axillary', 'a.', 'Situated in, or rising from, an axil; of or pertaining to\n   an axil.'),
(5251, 'Axinite', 'n.', 'A borosilicate of alumina, iron, and lime, commonly found\n   in glassy, brown crystals with acute edges.'),
(5252, 'Axiom', 'a.', 'A self-evident and necessary truth, or a proposition whose\n   truth is so evident as first sight that no reasoning or demonstration\n   can make it plainer; a proposition which it is necessary to take for\n   granted; as, \"The whole is greater than a part;\" \"A thing can not, at\n   the same time, be and not be.\"'),
(5253, 'Axiom', 'a.', 'An established principle in some art or science, which,\n   though not a necessary truth, is universally received; as, the axioms\n   of political economy.'),
(5254, 'Axle box', '', 'A bushing in the hub of a wheel, through which the axle\n   passes.'),
(5255, 'Axle box', '', 'The journal box of a rotating axle, especially a railway\n   axle.'),
(5256, 'Axled', 'a.', 'Having an axle; -- used in composition.'),
(5257, 'Axletree', 'n.', 'A bar or beam of wood or iron, connecting the opposite\n   wheels of a carriage, on the ends of which the wheels revolve.'),
(5258, 'Axletree', 'n.', 'A spindle or axle of a wheel.'),
(5259, 'Axmen', 'pl. ', 'of Axman'),
(5260, 'Axman', 'n.', 'One who wields an ax.'),
(5261, 'Axolotl', 'n.', 'An amphibian of the salamander tribe found in the elevated\n   lakes of Mexico; the siredon.'),
(5262, 'Axstone', 'n.', 'A variety of jade. It is used by some savages,\n   particularly the natives of the South Sea Islands, for making axes or\n   hatchets.'),
(5263, 'Axtree', 'n.', 'Axle or axletree.'),
(5264, 'Axunge', 'n.', 'Fat; grease; esp. the fat of pigs or geese; usually\n   (Pharm.), lard prepared for medical use.'),
(5265, 'Aye-aye', 'n.', 'A singular nocturnal quadruped, allied to the lemurs,\n   found in Madagascar (Cheiromys Madagascariensis), remarkable for its\n   long fingers, sharp nails, and rodent-like incisor teeth.'),
(5266, 'Ayegreen', 'n.', 'The houseleek (Sempervivum tectorum).'),
(5267, 'Ayein', 'adv. & prep.', 'Alt. of Ayeins'),
(5268, 'Ayeins', 'adv. & prep.', 'Again; back against.'),
(5269, 'Ayenward', 'adv.', 'Backward.'),
(5270, 'Ayond', 'prep. & adv.', 'Beyond.'),
(5271, 'Ayont', 'prep. & adv.', 'Beyond.'),
(5272, 'Ayrie', 'n.', 'Alt. of Ayry'),
(5273, 'Ayrshire', 'n.', 'One of a superior breed of cattle from Ayrshire,\n   Scotland. Ayrshires are notable for the quantity and quality of their\n   milk.'),
(5274, 'Azaleas', 'pl. ', 'of Azalea'),
(5275, 'Azalea', 'n.', 'A genus of showy flowering shrubs, mostly natives of China\n   or of North America; false honeysuckle. The genus is scarcely distinct\n   from Rhododendron.'),
(5276, 'Azarole', 'n.', 'The Neapolitan medlar (Crataegus azarolus), a shrub of\n   southern Europe; also, its fruit.'),
(5277, 'Azimuth', 'n.', 'The quadrant of an azimuth circle.'),
(5278, 'Azimuth', 'n.', 'An arc of the horizon intercepted between the meridian of\n   the place and a vertical circle passing through the center of any\n   object; as, the azimuth of a star; the azimuth or bearing of a line\n   surveying.'),
(5279, 'Azoic', 'a.', 'Destitute of any vestige of organic life, or at least of\n   animal life; anterior to the existence of animal life; formed when\n   there was no animal life on the globe; as, the azoic. rocks.'),
(5280, 'Azoleic', 'a.', 'Pertaining to an acid produced by treating oleic with\n   nitric acid.'),
(5281, 'Azonic', 'a.', 'Confined to no zone or region; not local.'),
(5282, 'Azorian', 'a.', 'Of or pertaining to the Azores.'),
(5283, 'Azorian', 'n.', 'A native of the Azores.'),
(5284, 'Azote', 'n.', 'Same as Nitrogen.'),
(5285, 'Azoth', 'n.', 'The first principle of metals, i. e., mercury, which was\n   formerly supposed to exist in all metals, and to be extractable from\n   them.'),
(5286, 'Azoth', 'n.', 'The universal remedy of Paracelsus.'),
(5287, 'Azotic', 'a.', 'Pertaining to azote, or nitrogen; formed or consisting of\n   azote; nitric; as, azotic gas; azotic acid.'),
(5288, 'Azotite', 'n.', 'A salt formed by the combination of azotous, or nitrous,\n   acid with a base; a nitrite.'),
(5289, 'Azotized', 'imp. & p. p.', 'of Azotize'),
(5290, 'Azotize', 'v. t.', 'To impregnate with azote, or nitrogen; to nitrogenize.'),
(5291, 'Azotous', 'a.', 'Nitrous; as, azotous acid.'),
(5292, 'Aztec', 'a.', 'Of or relating to one of the early races in Mexico that\n   inhabited the great plateau of that country at the time of the Spanish\n   conquest in 1519.'),
(5293, 'Aztec', 'n.', 'One of the Aztec race or people.'),
(5294, 'Azure', 'a.', 'Sky-blue; resembling the clear blue color of the unclouded\n   sky; cerulean; also, cloudless.'),
(5295, 'Azure', 'n.', 'The lapis lazuli.'),
(5296, 'Azure', 'n.', 'The clear blue color of the sky; also, a pigment or dye of\n   this color.'),
(5297, 'Azure', 'n.', 'The blue vault above; the unclouded sky.'),
(5298, 'Azure', 'n.', 'A blue color, represented in engraving by horizontal\n   parallel lines.'),
(5299, 'Azure', 'v. t.', 'To color blue.'),
(5300, 'Azured', 'a.', 'Of an azure color; sky-blue.'),
(5301, 'Azureous', 'a.', 'Of a fine blue color; azure.'),
(5302, 'Azurine', 'a.', 'Azure.'),
(5303, 'Azurine', 'n.', 'The blue roach of Europe (Leuciscus caeruleus); -- so\n   called from its color.'),
(5304, 'Azurite', 'n.', 'Blue carbonate of copper; blue malachite.'),
(5305, 'Azurn', 'a.', 'Azure.'),
(5306, 'Azygous', 'a.', 'Odd; having no fellow; not one of a pair; single; as, the\n   azygous muscle of the uvula.'),
(5307, 'Azyme', 'n.', 'Unleavened bread.'),
(5308, 'Azymic', 'a.', 'Azymous.'),
(5309, 'Azymite', 'n.', 'One who administered the Eucharist with unleavened bread;\n   -- a name of reproach given by those of the Greek church to the Latins.'),
(5310, 'Azymous', 'a.', 'Unleavened; unfermented.\n   B () is the second letter of the English alphabet. (See Guide to\n   Pronunciation, // 196, 220.) It is etymologically related to p, v, f, w\n   and m , letters representing sounds having a close organic affinity to\n   its own sound; as in Eng. bursar and purser; Eng. bear and Lat. ferre;\n   Eng. silver and Ger. silber; Lat. cubitum and It. gomito; Eng. seven,\n   Anglo-Saxon seofon, Ger. sieben, Lat. septem, Gr.\"epta`, Sanskrit\n   saptan. The form of letter B is Roman, from Greek B (Beta), of Semitic\n   origin. The small b was formed by gradual change from the capital B.'),
(5311, 'Baaing', 'n.', 'The bleating of a sheep.'),
(5312, 'Baalim', 'pl. ', 'of Baal'),
(5313, 'Baalism', 'n.', 'Worship of Baal; idolatry.'),
(5314, 'Baalist', 'n.', 'Alt. of Baalite'),
(5315, 'Baalite', 'n.', 'A worshiper of Baal; a devotee of any false religion; an\n   idolater.'),
(5316, 'Babbitt', 'v. t.', 'To line with Babbitt metal.'),
(5317, 'Babbled', 'imp. & p. p.', 'of Babble'),
(5318, 'Babbling', 'p. pr. & vb. n.', 'of Babble'),
(5319, 'Babble', 'v. i.', 'To utter words indistinctly or unintelligibly; to utter\n   inarticulate sounds; as a child babbles.'),
(5320, 'Babble', 'v. i.', 'To talk incoherently; to utter unmeaning words.'),
(5321, 'Babble', 'v. i.', 'To talk much; to chatter; to prate.'),
(5322, 'Babble', 'v. i.', 'To make a continuous murmuring noise, as shallow water\n   running over stones.'),
(5323, 'Babble', 'v. i.', 'To utter in an indistinct or incoherent way; to repeat,\n   as words, in a childish way without understanding.'),
(5324, 'Babble', 'v. i.', 'To disclose by too free talk, as a secret.'),
(5325, 'Babble', 'n.', 'Idle talk; senseless prattle; gabble; twaddle.'),
(5326, 'Babble', 'n.', 'Inarticulate speech; constant or confused murmur.'),
(5327, 'Babbler', 'n.', 'An idle talker; an irrational prater; a teller of secrets.'),
(5328, 'Babbler', 'n.', 'A hound too noisy on finding a good scent.'),
(5329, 'Babbler', 'n.', 'A name given to any one of family (Timalinae) of\n   thrushlike birds, having a chattering note.'),
(5330, 'Babblery', 'n.', 'Babble.'),
(5331, 'Babehood', 'n.', 'Babyhood.'),
(5332, 'Babel', 'n.', 'The city and tower in the land of Shinar, where the\n   confusion of languages took place.'),
(5333, 'Babel', 'n.', 'Hence: A place or scene of noise and confusion; a confused\n   mixture of sounds, as of voices or languages.'),
(5334, 'Babery', 'n.', 'Finery of a kind to please a child.'),
(5335, 'Babian', 'n.', 'Alt. of Babion'),
(5336, 'Babion', 'n.', 'A baboon.'),
(5337, 'Babish', 'a.', 'Like a babe; a childish; babyish.'),
(5338, 'Babism', 'n.', 'The doctrine of a modern religious sect, which originated\n   in Persia in 1843, being a mixture of Mohammedan, Christian, Jewish and\n   Parsee elements.'),
(5339, 'Babist', 'n.', 'A believer in Babism.'),
(5340, 'Bablah', 'n.', 'The ring of the fruit of several East Indian species of\n   acacia; neb-neb. It contains gallic acid and tannin, and is used for\n   dyeing drab.'),
(5341, 'Baboo', 'n.', 'Alt. of Babu'),
(5342, 'Baboon', 'n.', 'One of the Old World Quadrumana, of the genera Cynocephalus\n   and Papio; the dog-faced ape. Baboons have dog-like muzzles and large\n   canine teeth, cheek pouches, a short tail, and naked callosities on the\n   buttocks. They are mostly African. See Mandrill, and Chacma, and Drill\n   an ape.'),
(5343, 'Babies', 'pl. ', 'of Baby'),
(5344, 'Babied', 'imp. & p. p.', 'of Baby'),
(5345, 'Babying', 'p. pr. & vb. n.', 'of Baby'),
(5346, 'Babyhood', 'n.', 'The state or period of infancy.'),
(5347, 'Babyish', 'a.', 'Like a baby; childish; puerile; simple.'),
(5348, 'Babyism', 'n.', 'The state of being a baby.'),
(5349, 'Babyism', 'n.', 'A babyish manner of acting or speaking.'),
(5350, 'Babyship', 'n.', 'The quality of being a baby; the personality of an\n   infant.'),
(5351, 'Baccara', 'n.', 'Alt. of Baccarat'),
(5352, 'Baccarat', 'n.', 'A French game of cards, played by a banker and punters.'),
(5353, 'Baccare', 'interj.', 'Alt. of Backare'),
(5354, 'Backare', 'interj.', 'Stand back! give place! -- a cant word of the\n   Elizabethan writers, probably in ridicule of some person who pretended\n   to a knowledge of Latin which he did not possess.'),
(5355, 'Baccate', 'a.', 'Pulpy throughout, like a berry; -- said of fruits.'),
(5356, 'Baccated', 'a.', 'Having many berries.'),
(5357, 'Baccated', 'a.', 'Set or adorned with pearls.'),
(5358, 'Bacchant', 'n.', 'A priest of Bacchus.'),
(5359, 'Bacchant', 'n.', 'A bacchanal; a reveler.'),
(5360, 'Bacchant', 'a.', 'Bacchanalian; fond of drunken revelry; wine-loving;\n   reveling; carousing.'),
(5361, 'Bacchic', 'a.', 'Alt. of Bacchical'),
(5362, 'Bacchii', 'pl. ', 'of Bacchius'),
(5363, 'Bacchius', 'n.', 'A metrical foot composed of a short syllable and two long\n   ones; according to some, two long and a short.'),
(5364, 'Bacchus', 'n.', 'The god of wine, son of Jupiter and Semele.'),
(5365, 'Bachelor', 'n.', 'A man of any age who has not been married.'),
(5366, 'Bachelor', 'n.', 'An unmarried woman.'),
(5367, 'Bachelor', 'n.', 'A person who has taken the first or lowest degree in the\n   liberal arts, or in some branch of science, at a college or university;\n   as, a bachelor of arts.'),
(5368, 'Bachelor', 'n.', 'A knight who had no standard of his own, but fought under\n   the standard of another in the field; often, a young knight.'),
(5369, 'Bachelor', 'n.', 'In the companies of London tradesmen, one not yet\n   admitted to wear the livery; a junior member.'),
(5370, 'Bachelor', 'n.', 'A kind of bass, an edible fresh-water fish (Pomoxys\n   annularis) of the southern United States.'),
(5371, 'Bachelry', 'n.', 'The body of young aspirants for knighthood.'),
(5372, 'Bacillar', 'a.', 'Shaped like a rod or staff.'),
(5373, 'Bacilli', 'pl. ', 'of Bacillus'),
(5374, 'Bacillus', 'n.', 'A variety of bacterium; a microscopic, rod-shaped\n   vegetable organism.'),
(5375, 'Backed', 'imp. & p. p.', 'of Back'),
(5376, 'Backing', 'p. pr. & vb. n.', 'of Back'),
(5377, 'Backare', 'interj.', 'Same as Baccare.'),
(5378, 'Backband', 'n.', 'The band which passes over the back of a horse and holds\n   up the shafts of a carriage.'),
(5379, 'Backbite', 'v. i.', 'To wound by clandestine detraction; to censure meanly\n   or spitefully (an absent person); to slander or speak evil of (one\n   absent).'),
(5380, 'Backbite', 'v. i.', 'To censure or revile the absent.'),
(5381, 'Backbond', 'n.', 'An instrument which, in conjunction with another making\n   an absolute disposition, constitutes a trust.'),
(5382, 'Backbone', 'n.', 'The column of bones in the back which sustains and gives\n   firmness to the frame; the spine; the vertebral or spinal column.'),
(5383, 'Backbone', 'n.', 'Anything like , or serving the purpose of, a backbone.'),
(5384, 'Backbone', 'n.', 'Firmness; moral principle; steadfastness.'),
(5385, 'Backcast', 'n.', 'Anything which brings misfortune upon one, or causes\n   failure in an effort or enterprise; a reverse.'),
(5386, 'Backdoor', 'a.', 'Acting from behind and in concealment; as, backdoor\n   intrigues.'),
(5387, 'Backdown', 'n.', 'A receding or giving up; a complete surrender.'),
(5388, 'Backed', 'a.', 'Having a back; fitted with a back; as, a backed electrotype\n   or stereotype plate. Used in composition; as, broad-backed;\n   hump-backed.'),
(5389, 'Backer', 'n.', 'One who, or that which, backs; especially one who backs a\n   person or thing in a contest.'),
(5390, 'Backfall', 'n.', 'A fall or throw on the back in wrestling.'),
(5391, 'Backhand', 'n.', 'A kind of handwriting in which the downward slope of the\n   letters is from left to right.'),
(5392, 'Backhand', 'a.', 'Sloping from left to right; -- said of handwriting.'),
(5393, 'Backhand', 'a.', 'Backhanded; indirect; oblique.'),
(5394, 'Backing', 'n.', 'The act of moving backward, or of putting or moving\n   anything backward.'),
(5395, 'Backing', 'n.', 'That which is behind, and forms the back of, anything,\n   usually giving strength or stability.'),
(5396, 'Backing', 'n.', 'Support or aid given to a person or cause.'),
(5397, 'Backing', 'n.', 'The preparation of the back of a book with glue, etc.,\n   before putting on the cover.'),
(5398, 'Backlash', 'n.', 'The distance through which one part of connected\n   machinery, as a wheel, piston, or screw, can be moved without moving\n   the connected parts, resulting from looseness in fitting or from wear;\n   also, the jarring or reflex motion caused in badly fitting machinery by\n   irregularities in velocity or a reverse of motion.'),
(5399, 'Backless', 'a.', 'Without a back.'),
(5400, 'Backlog', 'n.', 'A large stick of wood, forming the back of a fire on the\n   hearth.'),
(5401, 'Backrack', 'n.', 'Alt. of Backrag'),
(5402, 'Backrag', 'n.', 'See Bacharach.'),
(5403, 'Backs', 'n. pl.', 'Among leather dealers, the thickest and stoutest tanned\n   hides.'),
(5404, 'Backsaw', 'n.', 'A saw (as a tenon saw) whose blade is stiffened by an\n   added metallic back.'),
(5405, 'Backset', 'n.', 'A check; a relapse; a discouragement; a setback.'),
(5406, 'Backset', 'n.', 'Whatever is thrown back in its course, as water.'),
(5407, 'Backset', 'v. i.', 'To plow again, in the fall; -- said of prairie land\n   broken up in the spring.'),
(5408, 'Backside', 'n.', 'The hinder part, posteriors, or rump of a person or\n   animal.'),
(5409, 'Backslid', 'imp.', 'of Backslide'),
(5410, 'Backslid', '', 'of Backslide'),
(5411, 'Backstay', 'n.', 'A rope or stay extending from the masthead to the side of\n   a ship, slanting a little aft, to assist the shrouds in supporting the\n   mast.'),
(5412, 'Backstay', 'n.', 'A rope or strap used to prevent excessive forward motion.'),
(5413, 'Backster', 'n.', 'A backer.'),
(5414, 'Backward', 'adv.', 'Alt. of Backwards'),
(5415, 'Backward', 'a.', 'Directed to the back or rear; as, backward glances.'),
(5416, 'Backward', 'a.', 'Unwilling; averse; reluctant; hesitating; loath.'),
(5417, 'Backward', 'a.', 'Not well advanced in learning; not quick of apprehension;\n   dull; inapt; as, a backward child.'),
(5418, 'Backward', 'a.', 'Late or behindhand; as, a backward season.'),
(5419, 'Backward', 'a.', 'Not advanced in civilization; undeveloped; as, the\n   country or region is in a backward state.'),
(5420, 'Backward', 'a.', 'Already past or gone; bygone.'),
(5421, 'Backward', 'n.', 'The state behind or past.'),
(5422, 'Backward', 'v. i.', 'To keep back; to hinder.'),
(5423, 'Backwash', 'v. i.', 'To clean the oil from (wood) after combing.'),
(5424, 'Backworm', 'n.', 'A disease of hawks. See Filanders.'),
(5425, 'Bacon', 'n.', 'The back and sides of a pig salted and smoked; formerly, the\n   flesh of a pig salted or fresh.'),
(5426, 'Baconian', 'a.', 'Of or pertaining to Lord Bacon, or to his system of\n   philosophy.'),
(5427, 'Bacteria', 'n.p.', 'See Bacterium.'),
(5428, 'Bacteria', 'pl. ', 'of Bacterium'),
(5429, 'Bactrian', 'a.', 'Of or pertaining to Bactria in Asia.'),
(5430, 'Bactrian', 'n.', 'A native of Bactria.'),
(5431, 'Bacule', 'n.', 'See Bascule.'),
(5432, 'Baculine', 'a.', 'Of or pertaining to the rod or punishment with the rod.'),
(5433, 'Baculite', 'n.', 'A cephalopod of the extinct genus Baculites, found fossil\n   in the Cretaceous rocks. It is like an uncoiled ammonite.'),
(5434, 'Badder', '', 'compar. of Bad, a.'),
(5435, 'Baddish', 'a.', 'Somewhat bad; inferior.'),
(5436, 'Badge', 'n.', 'A distinctive mark, token, sign, or cognizance, worn on the\n   person; as, the badge of a society; the badge of a policeman.'),
(5437, 'Badge', 'n.', 'Something characteristic; a mark; a token.'),
(5438, 'Badge', 'n.', 'A carved ornament on the stern of a vessel, containing a\n   window or the representation of one.'),
(5439, 'Badge', 'v. t.', 'To mark or distinguish with a badge.'),
(5440, 'Badger', 'n.', 'An itinerant licensed dealer in commodities used for food;\n   a hawker; a huckster; -- formerly applied especially to one who bought\n   grain in one place and sold it in another.'),
(5441, 'Badger', 'n.', 'A carnivorous quadruped of the genus Meles or of an allied\n   genus. It is a burrowing animal, with short, thick legs, and long claws\n   on the fore feet. One species (M. vulgaris), called also brock,\n   inhabits the north of Europe and Asia; another species (Taxidea\n   Americana / Labradorica) inhabits the northern parts of North America.\n   See Teledu.'),
(5442, 'Badger', 'n.', 'A brush made of badgers\' hair, used by artists.'),
(5443, 'Badgered', 'imp. & p. p.', 'of Badger'),
(5444, 'Badger', 'v. t.', 'To tease or annoy, as a badger when baited; to worry or\n   irritate persistently.'),
(5445, 'Badger', 'v. t.', 'To beat down; to cheapen; to barter; to bargain.'),
(5446, 'Badgerer', 'n.', 'One who badgers.'),
(5447, 'Badgerer', 'n.', 'A kind of dog used in badger baiting.'),
(5448, 'Badiaga', 'n.', 'A fresh-water sponge (Spongilla), common in the north of\n   Europe, the powder of which is used to take away the livid marks of\n   bruises.'),
(5449, 'Badian', 'n.', 'An evergreen Chinese shrub of the Magnolia family (Illicium\n   anisatum), and its aromatic seeds; Chinese anise; star anise.'),
(5450, 'Badigeon', 'n.', 'A cement or paste (as of plaster and freestone, or of\n   sawdust and glue or lime) used by sculptors, builders, and workers in\n   wood or stone, to fill holes, cover defects, or finish a surface.'),
(5451, 'Badinage', 'n.', 'Playful raillery; banter.'),
(5452, 'Badly', 'adv.', 'In a bad manner; poorly; not well; unskillfully;\n   imperfectly; unfortunately; grievously; so as to cause harm;\n   disagreeably; seriously.'),
(5453, 'Badness', 'n.', 'The state of being bad.'),
(5454, 'Baenopod', 'n.', 'One of the thoracic legs of Arthropods.'),
(5455, 'Baffled', 'imp. & p. p.', 'of Baffle'),
(5456, 'Baffling', 'p. pr. & vb. n.', 'of Baffle'),
(5457, 'Baffle', 'v. t.', 'To cause to undergo a disgraceful punishment, as a\n   recreant knight.'),
(5458, 'Baffle', 'v. t.', 'To check by shifts and turns; to elude; to foil.'),
(5459, 'Baffle', 'v. t.', 'To check by perplexing; to disconcert, frustrate, or\n   defeat; to thwart.'),
(5460, 'Baffle', 'v. i.', 'To practice deceit.'),
(5461, 'Baffle', 'v. i.', 'To struggle against in vain; as, a ship baffles with the\n   winds.'),
(5462, 'Baffle', 'n.', 'A defeat by artifice, shifts, and turns; discomfiture.'),
(5463, 'Baffler', 'n.', 'One who, or that which, baffles.'),
(5464, 'Baffling', 'a.', 'Frustrating; discomfiting; disconcerting; as, baffling\n   currents, winds, tasks.'),
(5465, 'Bafta', 'n.', 'A coarse stuff, usually of cotton, originally made in India.\n   Also, an imitation of this fabric made for export.'),
(5466, 'Bagged', 'imp. & p. p.', 'of Bag'),
(5467, 'Bagging', 'p. pr. & vb. n.', 'of Bag'),
(5468, 'Bagasse', 'n.', 'Sugar cane, as it comes crushed from the mill. It is then\n   dried and used as fuel. Also extended to the refuse of beetroot sugar.'),
(5469, 'Baggage', 'n.', 'The clothes, tents, utensils, and provisions of an army.'),
