(5717, 'Bangue', 'n.', 'See Bhang.'),
(5718, 'Banging', 'a.', 'Huge; great in size.'),
(5719, 'Bangle', 'v. t.', 'To waste by little and little; to fritter away.'),
(5720, 'Bangle', 'n.', 'An ornamental circlet, of glass, gold, silver, or other\n   material, worn by women in India and Africa, and in some other\n   countries, upon the wrist or ankle; a ring bracelet.'),
(5721, 'Banian', 'n.', 'A Hindoo trader, merchant, cashier, or money changer.'),
(5722, 'Banian', 'n.', 'A man\'s loose gown, like that worn by the Banians.'),
(5723, 'Banian', 'n.', 'The Indian fig. See Banyan.'),
(5724, 'Banished', 'imp. & p. p.', 'of Banish'),
(5725, 'Banish', 'v. t.', 'To condemn to exile, or compel to leave one\'s country,\n   by authority of the ruling power.'),
(5726, 'Banish', 'v. t.', 'To drive out, as from a home or familiar place; -- used\n   with from and out of.'),
(5727, 'Banish', 'v. t.', 'To drive away; to compel to depart; to dispel.'),
(5728, 'Banisher', 'n.', 'One who banishes.'),
(5729, 'Banister', 'n.', 'A stringed musical instrument having a head and neck like\n   the guitar, and its body like a tambourine. It has five strings, and is\n   played with the fingers and hands.'),
(5730, 'Banked', 'imp. & p. p.', 'of Bank'),
(5731, 'Banking', 'p. pr. & vb. n.', 'of Bank'),
(5732, 'Bankable', 'a.', 'Receivable at a bank.'),
(5733, 'Banker', 'n.', 'One who conducts the business of banking; one who,\n   individually, or as a member of a company, keeps an establishment for\n   the deposit or loan of money, or for traffic in money, bills of\n   exchange, etc.'),
(5734, 'Banker', 'n.', 'A money changer.'),
(5735, 'Banker', 'n.', 'The dealer, or one who keeps the bank in a gambling house.'),
(5736, 'Banker', 'n.', 'A vessel employed in the cod fishery on the banks of\n   Newfoundland.'),
(5737, 'Banker', 'n.', 'A ditcher; a drain digger.'),
(5738, 'Banker', 'n.', 'The stone bench on which masons cut or square their work.'),
(5739, 'Banking', 'n.', 'The business of a bank or of a banker.'),
(5740, 'Bankrupt', 'n.', 'A trader who secretes himself, or does certain other acts\n   tending to defraud his creditors.'),
(5741, 'Bankrupt', 'n.', 'A trader who becomes unable to pay his debts; an\n   insolvent trader; popularly, any person who is unable to pay his debts;\n   an insolvent person.'),
(5742, 'Bankrupt', 'n.', 'A person who, in accordance with the terms of a law\n   relating to bankruptcy, has been judicially declared to be unable to\n   meet his liabilities.'),
(5743, 'Bankrupt', 'a.', 'Being a bankrupt or in a condition of bankruptcy; unable\n   to pay, or legally discharged from paying, one\'s debts; as, a bankrupt\n   merchant.'),
(5744, 'Bankrupt', 'a.', 'Depleted of money; not having the means of meeting\n   pecuniary liabilities; as, a bankrupt treasury.'),
(5745, 'Bankrupt', 'a.', 'Relating to bankrupts and bankruptcy.'),
(5746, 'Bankrupt', 'a.', 'Destitute of, or wholly wanting (something once\n   possessed, or something one should possess).'),
(5747, 'Bankrupt', 'v. t.', 'To make bankrupt; to bring financial ruin upon; to\n   impoverish.'),
(5748, 'Bankside', 'n.', 'The slope of a bank, especially of the bank of a steam.'),
(5749, 'Banlieue', 'n.', 'The territory without the walls, but within the legal\n   limits, of a town or city.'),
(5750, 'Banner', 'n.', 'A kind of flag attached to a spear or pike by a crosspiece,\n   and used by a chief as his standard in battle.'),
(5751, 'Banner', 'n.', 'A large piece of silk or other cloth, with a device or\n   motto, extended on a crosspiece, and borne in a procession, or\n   suspended in some conspicuous place.'),
(5752, 'Banner', 'n.', 'Any flag or standard; as, the star-spangled banner.'),
(5753, 'Bannered', 'a.', 'Furnished with, or bearing, banners.'),
(5754, 'Banneret', 'n.', 'Originally, a knight who led his vassals into the field\n   under his own banner; -- commonly used as a title of rank.'),
(5755, 'Banneret', 'n.', 'A title of rank, conferred for heroic deeds, and hence,\n   an order of knighthood; also, the person bearing such title or rank.'),
(5756, 'Banneret', 'n.', 'A civil officer in some Swiss cantons.'),
(5757, 'Banneret', 'n.', 'A small banner.'),
(5758, 'Bannerol', 'n.', 'A banderole; esp. a banner displayed at a funeral\n   procession and set over the tomb. See Banderole.'),
(5759, 'Bannock', 'n.', 'A kind of cake or bread, in shape flat and roundish,\n   commonly made of oatmeal or barley meal and baked on an iron plate, or\n   griddle; -- used in Scotland and the northern counties of England.'),
(5760, 'Banns', 'n. pl.', 'Notice of a proposed marriage, proclaimed in a church,\n   or other place prescribed by law, in order that any person may object,\n   if he knows of just cause why the marriage should not take place.'),
(5761, 'Banquet', 'n.', 'A feast; a sumptuous entertainment of eating and drinking;\n   often, a complimentary or ceremonious feast, followed by speeches.'),
(5762, 'Banquet', 'n.', 'A dessert; a course of sweetmeats; a sweetmeat or\n   sweetmeats.'),
(5763, 'Banquet', 'v. t.', 'To treat with a banquet or sumptuous entertainment of\n   food; to feast.'),
(5764, 'Banquet', 'v. i.', 'To regale one\'s self with good eating and drinking; to\n   feast.'),
(5765, 'Banquet', 'v. i.', 'To partake of a dessert after a feast.'),
(5766, 'Banshee', 'n.', 'Alt. of Banshie'),
(5767, 'Banshie', 'n.', 'A supernatural being supposed by the Irish and Scotch\n   peasantry to warn a family of the speedy death of one of its members,\n   by wailing or singing in a mournful voice under the windows of the\n   house.'),
(5768, 'Bantam', 'n.', 'A variety of small barnyard fowl, with feathered legs,\n   probably brought from Bantam, a district of Java.'),
(5769, 'Banteng', 'n.', 'The wild ox of Java (Bibos Banteng).'),
(5770, 'Bantered', 'imp. & p. p.', 'of Banter'),
(5771, 'Banter', 'v. t.', 'To address playful good-natured ridicule to, -- the\n   person addressed, or something pertaining to him, being the subject of\n   the jesting; to rally; as, he bantered me about my credulity.'),
(5772, 'Banter', 'v. t.', 'To jest about; to ridicule in speaking of, as some\n   trait, habit, characteristic, and the like.'),
(5773, 'Banter', 'v. t.', 'To delude or trick, -- esp. by way of jest.'),
(5774, 'Banter', 'v. t.', 'To challenge or defy to a match.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(5775, 'Banter', 'n.', 'The act of bantering; joking or jesting; humorous or\n   good-humored raillery; pleasantry.'),
(5776, 'Banterer', 'n.', 'One who banters or rallies.'),
(5777, 'Bantling', 'n.', 'A young or small child; an infant. [Slightly contemptuous\n   or depreciatory.]'),
(5778, 'Banxring', 'n.', 'An East Indian insectivorous mammal of the genus Tupaia.'),
(5779, 'Banyan', 'n.', 'A tree of the same genus as the common fig, and called the\n   Indian fig (Ficus Indica), whose branches send shoots to the ground,\n   which take root and become additional trunks, until it may be the tree\n   covers some acres of ground and is able to shelter thousands of men.'),
(5780, 'Baobab', 'n.', 'A gigantic African tree (Adansonia digitata), also\n   naturalized in India. See Adansonia.'),
(5781, 'Baphomet', 'n.', 'An idol or symbolical figure which the Templars were\n   accused of using in their mysterious rites.'),
(5782, 'Baptism', 'v. i.', 'The act of baptizing; the application of water to a\n   person, as a sacrament or religious ceremony, by which he is initiated\n   into the visible church of Christ. This is performed by immersion,\n   sprinkling, or pouring.'),
(5783, 'Baptist', 'n.', 'One who administers baptism; -- specifically applied to\n   John, the forerunner of Christ.'),
(5784, 'Baptist', 'n.', 'One of a denomination of Christians who deny the validity\n   of infant baptism and of sprinkling, and maintain that baptism should\n   be administered to believers alone, and should be by immersion. See\n   Anabaptist.'),
(5785, '-tries', 'pl. ', 'of Baptistry'),
(5786, 'Baptized', 'imp. & p. p.', 'of Baptize'),
(5787, 'Baptize', 'v. t.', 'To administer the sacrament of baptism to.'),
(5788, 'Baptize', 'v. t.', 'To christen ( because a name is given to infants at\n   their baptism); to give a name to; to name.'),
(5789, 'Baptize', 'v. t.', 'To sanctify; to consecrate.'),
(5790, 'Baptizer', 'n.', 'One who baptizes.'),
(5791, 'Barred', 'imp. & p. p.', 'of Bar'),
(5792, 'Barring', 'p. pr. & vb. n.', 'of Bar'),
(5793, 'Barbed', 'imp. & p. p.', 'of Barb'),
(5794, 'Barbing', 'p. pr. & vb. n.', 'of Barb'),
(5795, 'Barbacan', 'n.', 'See Barbican.'),
(5796, 'Barbados', 'n.', 'Alt. of Barbadoes'),
(5797, 'Barbara', 'n.', 'The first word in certain mnemonic lines which represent\n   the various forms of the syllogism. It indicates a syllogism whose\n   three propositions are universal affirmatives.'),
(5798, 'Barbaic', 'a.', 'Of, or from, barbarian nations; foreign; -- often with\n   reference to barbarous nations of east.'),
(5799, 'Barbaic', 'a.', 'Of or pertaining to, or resembling, an uncivilized person\n   or people; barbarous; barbarian; destitute of refinement.'),
(5800, 'Barbary', 'n.', 'The countries on the north coast of Africa from Egypt to\n   the Atlantic. Hence: A Barbary horse; a barb. [Obs.] Also, a kind of\n   pigeon.'),
(5801, 'Barbate', 'a.', 'Bearded; beset with long and weak hairs.'),
(5802, 'Barbated', 'a.', 'Having barbed points.'),
(5803, 'Barbecue', 'n.', 'A hog, ox, or other large animal roasted or broiled whole\n   for a feast.'),
(5804, 'Barbecue', 'n.', 'A social entertainment, where many people assemble,\n   usually in the open air, at which one or more large animals are roasted\n   or broiled whole.'),
(5805, 'Barbecue', 'n.', 'A floor, on which coffee beans are sun-dried.'),
(5806, 'Barbecue', 'v. t.', 'To dry or cure by exposure on a frame or gridiron.'),
(5807, 'Barbecue', 'v. t.', 'To roast or broil whole, as an ox or hog.'),
(5808, 'Barbed', 'a.', 'Accoutered with defensive armor; -- said of a horse. See\n   Barded ( which is the proper form.)'),
(5809, 'Barbed', 'a.', 'Furnished with a barb or barbs; as, a barbed arrow; barbed\n   wire.'),
(5810, 'Barbel', 'n.', 'A slender tactile organ on the lips of certain fished.'),
(5811, 'Barbel', 'n.', 'A large fresh-water fish ( Barbus vulgaris) found in many\n   European rivers. Its upper jaw is furnished with four barbels.'),
(5812, 'Barbel', 'n.', 'Barbs or paps under the tongued of horses and cattle. See\n   1st Barb, 3.'),
(5813, 'Barber', 'n.', 'One whose occupation it is to shave or trim the beard, and\n   to cut and dress the hair of his patrons.'),
(5814, 'Barbered', 'imp. & p. p.', 'of Barber'),
(5815, 'Barber', 'v. t.', 'To shave and dress the beard or hair of.'),
(5816, 'Barberry', 'n.', 'A shrub of the genus Berberis, common along roadsides and\n   in neglected fields. B. vulgaris is the species best known; its oblong\n   red berries are made into a preserve or sauce, and have been deemed\n   efficacious in fluxes and fevers. The bark dyes a fine yellow, esp. the\n   bark of the root.'),
(5817, 'Barbet', 'n.', 'A variety of small dog, having long curly hair.'),
(5818, 'Barbet', 'n.', 'A bird of the family Bucconidae, allied to the Cuckoos,\n   having a large, conical beak swollen at the base, and bearded with five\n   bunches of stiff bristles; the puff bird. It inhabits tropical America\n   and Africa.'),
(5819, 'Barbet', 'n.', 'A larva that feeds on aphides.'),
(5820, 'Barbette', 'n.', 'A mound of earth or a platform in a fortification, on\n   which guns are mounted to fire over the parapet.'),
(5821, 'Barbican', 'n.', 'Alt. of Barbacan'),
(5822, 'Barbacan', 'n.', 'A tower or advanced work defending the entrance to a\n   castle or city, as at a gate or bridge. It was often large and strong,\n   having a ditch and drawbridge of its own.'),
(5823, 'Barbacan', 'n.', 'An opening in the wall of a fortress, through which\n   missiles were discharged upon an enemy.'),
(5824, 'Barbicel', 'n.', 'One of the small hooklike processes on the barbules of\n   feathers.'),
(5825, 'Barbiers', 'n.', 'A variety of paralysis, peculiar to India and the Malabar\n   coast; -- considered by many to be the same as beriberi in chronic\n   form.'),
(5826, 'Barbiton', 'n.', 'An ancient Greek instrument resembling a lyre.'),
(5827, 'Barble', 'n.', 'See Barbel.'),
(5828, 'Barbre', 'a.', 'Barbarian.'),
(5829, 'Barbule', 'n.', 'A very minute barb or beard.'),
(5830, 'Barbule', 'n.', 'One of the processes along the edges of the barbs of a\n   feather, by which adjacent barbs interlock. See Feather.'),
(5831, 'Barcon', 'n.', 'A vessel for freight; -- used in Mediterranean.'),
(5832, 'Barde', 'n.', 'A piece of defensive (or, sometimes, ornamental) armor for a\n   horse\'s neck, breast, and flanks; a barb. [Often in the pl.]'),
(5833, 'Barde', 'pl.', 'Defensive armor formerly worn by a man at arms.'),
(5834, 'Barde', 'pl.', 'A thin slice of fat bacon used to cover any meat or game.'),
(5835, 'Barded', 'p.a.', 'Accoutered with defensive armor; -- said of a horse.'),
(5836, 'Barded', 'p.a.', 'Wearing rich caparisons.'),
(5837, 'Bardic', 'a.', 'Of or pertaining to bards, or their poetry.'),
(5838, 'Bardish', 'a.', 'Pertaining to, or written by, a bard or bards.'),
(5839, 'Bardism', 'n.', 'The system of bards; the learning and maxims of bards.'),
(5840, 'Bardling', 'n.', 'An inferior bard.'),
(5841, 'Bardship', 'n.', 'The state of being a bard.'),
(5842, 'Bared', 'imp. & p. p.', 'of Bare'),
(5843, 'Baring', 'p. pr. & vb. n.', 'of Bare'),
(5844, 'Bareback', 'adv.', 'On the bare back of a horse, without using a saddle;\n   as, to ride bareback.'),
(5845, 'Barebone', 'n.', 'A very lean person; one whose bones show through the\n   skin.'),
(5846, 'Barefoot', 'a. & adv.', 'With the feet bare; without shoes or stockings.'),
(5847, 'Barege', 'n.', 'A gauzelike fabric for ladies\' dresses, veils, etc. of\n   worsted, silk and worsted, or cotton and worsted.'),
(5848, 'Barehead', 'a. & adv.', 'Having the head uncovered; as, a bareheaded girl.'),
(5849, 'Barely', 'adv.', 'Without covering; nakedly.'),
(5850, 'Barely', 'adv.', 'Without concealment or disguise.'),
(5851, 'Barely', 'adv.', 'Merely; only.'),
(5852, 'Barely', 'adv.', 'But just; without any excess; with nothing to spare ( of\n   quantity, time, etc.); hence, scarcely; hardly; as, there was barely\n   enough for all; he barely escaped.'),
(5853, 'Bareness', 'n.', 'The state of being bare.'),
(5854, 'Baresark', 'n.', 'A Berserker, or Norse warrior who fought without armor,\n   or shirt of mail. Hence, adverbially: Without shirt of mail or armor.'),
(5855, 'Barfish', 'n.', 'Same as Calico bass.'),
(5856, 'Barful', 'a.', 'Full of obstructions.'),
(5857, 'Bargain', 'n.', 'An agreement between parties concerning the sale of\n   property; or a contract by which one party binds himself to transfer\n   the right to some property for a consideration, and the other party\n   binds himself to receive the property and pay the consideration.'),
(5858, 'Bargain', 'n.', 'An agreement or stipulation; mutual pledge.'),
(5859, 'Bargain', 'n.', 'A purchase; also ( when not qualified), a gainful\n   transaction; an advantageous purchase; as, to buy a thing at a bargain.'),
(5860, 'Bargain', 'n.', 'The thing stipulated or purchased; also, anything bought\n   cheap.'),
(5861, 'Bargain', 'n.', 'To make a bargain; to make a contract for the exchange of\n   property or services; -- followed by with and for; as, to bargain with\n   a farmer for a cow.'),
(5862, 'Bargain', 'v. t.', 'To transfer for a consideration; to barter; to trade;\n   as, to bargain one horse for another.'),
(5863, 'Barge', 'n.', 'A pleasure boat; a vessel or boat of state, elegantly\n   furnished and decorated.'),
(5864, 'Barge', 'n.', 'A large, roomy boat for the conveyance of passengers or\n   goods; as, a ship\'s barge; a charcoal barge.'),
(5865, 'Barge', 'n.', 'A large boat used by flag officers.'),
(5866, 'Barge', 'n.', 'A double-decked passenger or freight vessel, towed by a\n   steamboat.'),
(5867, 'Barge', 'n.', 'A large omnibus used for excursions.'),
(5868, 'Bargee', 'n.', 'A bargeman.'),
(5869, 'Bargeman', 'n.', 'The man who manages a barge, or one of the crew of a\n   barge.'),
(5870, 'Barger', 'n.', 'The manager of a barge.'),
(5871, 'Barghest', 'n.', 'A goblin, in the shape of a large dog, portending\n   misfortune.'),
(5872, 'Baria', 'n.', 'Baryta.'),
(5873, 'Baric', 'a.', 'Of or pertaining to barium; as, baric oxide.'),
(5874, 'Baric', 'a.', 'Of or pertaining to weight, esp. to the weight or pressure\n   of the atmosphere as measured by the barometer.'),
(5875, 'Barilla', 'n.', 'A name given to several species of Salsola from which soda\n   is made, by burning the barilla in heaps and lixiviating the ashes.'),
(5876, 'Barilla', 'n.', 'The alkali produced from the plant, being an impure\n   carbonate of soda, used for making soap, glass, etc., and for bleaching\n   purposes.'),
(5877, 'Barilla', 'n.', 'Impure soda obtained from the ashes of any seashore plant,\n   or kelp.'),
(5878, 'Barillet', 'n.', 'A little cask, or something resembling one.'),
(5879, 'Bar iron', '', 'See under Iron.'),
(5880, 'Barite', 'n.', 'Native sulphate of barium, a mineral occurring in\n   transparent, colorless, white to yellow crystals (generally tabular),\n   also in granular form, and in compact massive forms resembling marble.\n   It has a high specific gravity, and hence is often called heavy spar.\n   It is a common mineral in metallic veins.'),
(5881, 'Baritone', 'a. & n.', 'See Barytone.'),
(5882, 'Barium', 'n.', 'One of the elements, belonging to the alkaline earth group;\n   a metal having a silver-white color, and melting at a very high\n   temperature. It is difficult to obtain the pure metal, from the\n   facility with which it becomes oxidized in the air. Atomic weight, 137.\n   Symbol, Ba. Its oxide called baryta.'),
(5883, 'Barked', 'imp. & p. p.', 'of Bark'),
(5884, 'Barking', 'p. pr. & vb. n.', 'of Bark'),
(5885, 'Barque', 'n.', 'Formerly, any small sailing vessel, as a pinnace, fishing\n   smack, etc.; also, a rowing boat; a barge. Now applied poetically to a\n   sailing vessel or boat of any kind.'),
(5886, 'Barque', 'n.', 'A three-masted vessel, having her foremast and mainmast\n   square-rigged, and her mizzenmast schooner-rigged.'),
(5887, 'Barken', 'a.', 'Made of bark.'),
(5888, 'Barker', 'n.', 'An animal that barks; hence, any one who clamors\n   unreasonably.'),
(5889, 'Barker', 'n.', 'One who stands at the doors of shops to urg/ passers by to\n   make purchases.'),
(5890, 'Barker', 'n.', 'A pistol.'),
(5891, 'Barker', 'n.', 'The spotted redshank.'),
(5892, 'Barker', 'n.', 'One who strips trees of their bark.'),
(5893, 'Barkery', 'n.', 'A tanhouse.'),
(5894, 'Barkless', 'a.', 'Destitute of bark.'),
(5895, 'Barky', 'a.', 'Covered with, or containing, bark.'),
(5896, 'Barley', 'n.', 'A valuable grain, of the family of grasses, genus Hordeum,\n   used for food, and for making malt, from which are prepared beer, ale,\n   and whisky.'),
(5897, 'Barmaid', 'n.', 'A girl or woman who attends the customers of a bar, as in\n   a tavern or beershop.'),
(5898, 'Barmote', 'n.', 'A court held in Derbyshire, in England, for deciding\n   controversies between miners.'),
(5899, 'Balmy', 'a.', 'Full of barm or froth; in a ferment.'),
(5900, 'Barnacle', 'n.', 'Any cirriped crustacean adhering to rocks, floating\n   timber, ships, etc., esp. (a) the sessile species (genus Balanus and\n   allies), and (b) the stalked or goose barnacles (genus Lepas and\n   allies). See Cirripedia, and Goose barnacle.'),
(5901, 'Barnacle', 'n.', 'A bernicle goose.'),
(5902, 'Barnacle', 'n.', 'An instrument for pinching a horse\'s nose, and thus\n   restraining him.'),
(5903, 'Barnacle', 'sing.', 'Spectacles; -- so called from their resemblance to the\n   barnacles used by farriers.'),
(5904, 'Barnyard', 'n.', 'A yard belonging to a barn.'),
(5905, 'Barocco', 'a.', 'See Baroque.'),
(5906, 'Baroko', 'n.', 'A form or mode of syllogism of which the first proposition\n   is a universal affirmative, and the other two are particular negative.'),
(5907, 'Barology', 'n.', 'The science of weight or gravity.'),
(5908, 'Barometz', 'n.', 'The woolly-skinned rhizoma or rootstock of a fern\n   (Dicksonia barometz), which, when specially prepared and inverted,\n   somewhat resembles a lamb; -- called also Scythian lamb.'),
(5909, 'Baron', 'n.', 'A title or degree of nobility; originally, the possessor of\n   a fief, who had feudal tenants under him; in modern times, in France\n   and Germany, a nobleman next in rank below a count; in England, a\n   nobleman of the lowest grade in the House of Lords, being next below a\n   viscount.'),
(5910, 'Baron', 'n.', 'A husband; as, baron and feme, husband and wife.'),
(5911, 'Baronage', 'n.', 'The whole body of barons or peers.'),
(5912, 'Baronage', 'n.', 'The dignity or rank of a baron.'),
(5913, 'Baronage', 'n.', 'The land which gives title to a baron.'),
(5914, 'Baroness', 'n.', 'A baron\'s wife; also, a lady who holds the baronial title\n   in her own right; as, the Baroness Burdett-Coutts.'),
(5915, 'Baronet', 'n.', 'A dignity or degree of honor next below a baron and above\n   a knight, having precedency of all orders of knights except those of\n   the Garter. It is the lowest degree of honor that is hereditary. The\n   baronets are commoners.'),
(5916, 'Baronial', 'a.', 'Pertaining to a baron or a barony.'),
(5917, 'Baronies', 'pl. ', 'of Barony'),
(5918, 'Barony', 'n.', 'The fee or domain of a baron; the lordship, dignity, or\n   rank of a baron.'),
(5919, 'Barony', 'n.', 'In Ireland, a territorial division, corresponding nearly to\n   the English hundred, and supposed to have been originally the district\n   of a native chief. There are 252 of these baronies. In Scotland, an\n   extensive freehold. It may be held by a commoner.'),
(5920, 'Baroque', 'a.', 'In bad taste; grotesque; odd.'),
(5921, 'Barouche', 'n.', 'A four-wheeled carriage, with a falling top, a seat on\n   the outside for the driver, and two double seats on the inside arranged\n   so that the sitters on the front seat face those on the back seat.'),
(5922, 'Barpost', 'n.', 'A post sunk in the ground to receive the bars closing a\n   passage into a field.'),
(5923, 'Barque', 'n.', 'Same as 3d Bark, n.'),
(5924, 'Barracan', 'n.', 'A thick, strong stuff, somewhat like camlet; -- still\n   used for outer garments in the Levant.'),
(5925, 'Barrack', 'n.', 'A building for soldiers, especially when in garrison.\n   Commonly in the pl., originally meaning temporary huts, but now usually\n   applied to a permanent structure or set of buildings.'),
(5926, 'Barrack', 'n.', 'A movable roof sliding on four posts, to cover hay, straw,\n   etc.'),
(5927, 'Barrack', 'v. t.', 'To supply with barracks; to establish in barracks; as,\n   to barrack troops.'),
(5928, 'Barrack', 'v. i.', 'To live or lodge in barracks.'),
(5929, 'Barrage', 'n.', 'An artificial bar or obstruction placed in a river or\n   water course to increase the depth of water; as, the barrages of the\n   Nile.'),
(5930, 'Barranca', 'n.', 'A ravine caused by heavy rains or a watercourse.'),
(5931, 'Barras', 'n.', 'A resin, called also galipot.'),
(5932, 'Barrator', 'v. i.', 'One guilty of barratry.'),
(5933, 'Barratry', 'n.', 'The practice of exciting and encouraging lawsuits and\n   quarrels.'),
(5934, 'Barratry', 'n.', 'A fraudulent breach of duty or willful act of known\n   illegality on the part of a master of a ship, in his character of\n   master, or of the mariners, to the injury of the owner of the ship or\n   cargo, and without his consent. It includes every breach of trust\n   committed with dishonest purpose, as by running away with the ship,\n   sinking or deserting her, etc., or by embezzling the cargo.'),
(5935, 'Barratry', 'n.', 'The crime of a judge who is influenced by bribery in\n   pronouncing judgment.'),
(5936, 'Barrel', 'n.', 'A round vessel or cask, of greater length than breadth, and\n   bulging in the middle, made of staves bound with hoops, and having flat\n   ends or heads.'),
(5937, 'Barrel', 'n.', 'The quantity which constitutes a full barrel. This varies\n   for different articles and also in different places for the same\n   article, being regulated by custom or by law. A barrel of wine is 31/\n   gallons; a barrel of flour is 196 pounds.'),
(5938, 'Barrel', 'n.', 'A solid drum, or a hollow cylinder or case; as, the barrel\n   of a windlass; the barrel of a watch, within which the spring is\n   coiled.'),
(5939, 'Barrel', 'n.', 'A metallic tube, as of a gun, from which a projectile is\n   discharged.'),
(5940, 'Barrel', 'n.', 'A jar.'),
(5941, 'Barrel', 'n.', 'The hollow basal part of a feather.'),
(5942, 'Barreled', 'imp. & p. p.', 'of Barrel'),
(5943, 'Barrel', 'v. t.', 'To put or to pack in a barrel or barrels.'),
(5944, 'Barreled', 'a.', 'Alt. of Barrelled'),
(5945, 'Barren', 'a.', 'Incapable of producing offspring; producing no young;\n   sterile; -- said of women and female animals.'),
(5946, 'Barren', 'a.', 'Not producing vegetation, or useful vegetation; /rile.'),
(5947, 'Barren', 'a.', 'Unproductive; fruitless; unprofitable; empty.'),
(5948, 'Barren', 'a.', 'Mentally dull; stupid.'),
(5949, 'Barren', 'n.', 'A tract of barren land.'),
(5950, 'Barren', 'n.', 'Elevated lands or plains on which grow small trees, but not\n   timber; as, pine barrens; oak barrens. They are not necessarily\n   sterile, and are often fertile.'),
(5951, 'Barrenly', 'adv.', 'Unfruitfully; unproductively.'),
(5952, 'Barret', 'n.', 'A kind of cap formerly worn by soldiers; -- called also\n   barret cap. Also, the flat cap worn by Roman Catholic ecclesiastics.'),
(5953, 'Barrier', 'n.', 'A carpentry obstruction, stockade, or other obstacle made\n   in a passage in order to stop an enemy.'),
(5954, 'Barrier', 'n.', 'A fortress or fortified town, on the frontier of a\n   country, commanding an avenue of approach.'),
(5955, 'Barrier', 'n.', 'A fence or railing to mark the limits of a place, or to\n   keep back a crowd.'),
(5956, 'Barrier', 'n.', 'An any obstruction; anything which hinders approach or\n   attack.'),
(5957, 'Barrier', 'n.', 'Any limit or boundary; a line of separation.'),
(5958, 'Barroom', 'n.', 'A room containing a bar or counter at which liquors are\n   sold.'),
(5959, 'Barrow', 'n.', 'A support having handles, and with or without a wheel, on\n   which heavy or bulky things can be transported by hand. See Handbarrow,\n   and Wheelbarrow.'),
(5960, 'Barrow', 'n.', 'A wicker case, in which salt is put to drain.'),
(5961, 'Barrow', 'n.', 'A hog, esp. a male hog castrated.'),
(5962, 'Barrow', 'n.', 'A large mound of earth or stones over the remains of the\n   dead; a tumulus.'),
(5963, 'Barrow', 'n.', 'A heap of rubbish, attle, etc.'),
(5964, 'Barrulet', 'n.', 'A diminutive of the bar, having one fourth its width.'),
(5965, 'Barruly', 'a.', 'Traversed by barrulets or small bars; -- said of the\n   field.'),
(5966, 'Barry', 'a.', 'Divided into bars; -- said of the field.'),
(5967, 'Barse', 'n.', 'The common perch. See 1st Bass.'),
(5968, 'Bartered', 'imp. & p. p.', 'of Barter'),
(5969, 'Barter', 'v. i.', 'To traffic or trade, by exchanging one commodity for\n   another, in distinction from a sale and purchase, in which money is\n   paid for the commodities transferred; to truck.'),
(5970, 'Barter', 'v. t.', 'To trade or exchange in the way of barter; to exchange\n   (frequently for an unworthy consideration); to traffic; to truck; --\n   sometimes followed by away; as, to barter away goods or honor.'),
(5971, 'Barter', 'n.', 'The act or practice of trafficking by exchange of\n   commodities; an exchange of goods.'),
(5972, 'Barter', 'n.', 'The thing given in exchange.'),
(5973, 'Barterer', 'n.', 'One who barters.'),
(5974, 'Bartery', 'n.', 'Barter.'),
(5975, 'Barth', 'n.', 'A place of shelter for cattle.'),
(5976, 'Bartizan', 'n.', 'A small, overhanging structure for lookout or defense,\n   usually projecting at an angle of a building or near an entrance\n   gateway.'),
(5977, 'Bartlett', 'n.', 'A Bartlett pear, a favorite kind of pear, which\n   originated in England about 1770, and was called Williams\' Bonchretien.\n   It was brought to America, and distributed by Mr. Enoch Bartlett, of\n   Dorchester, Massachusetts.'),
(5978, 'Barton', 'n.', 'The demesne lands of a manor; also, the manor itself.'),
(5979, 'Barton', 'n.', 'A farmyard.'),
(5980, 'Bartram', 'n.', 'See Bertram.'),
(5981, 'Barway', 'n.', 'A passage into a field or yard, closed by bars made to take\n   out of the posts.'),
(5982, 'Barwise', 'adv.', 'Horizontally.'),
(5983, 'Barwood', 'n.', 'A red wood of a leguminous tree (Baphia nitida), from\n   Angola and the Gaboon in Africa. It is used as a dyewood, and also for\n   ramrods, violin bows and turner\'s work.'),
(5984, 'Baryta', 'n.', 'An oxide of barium (or barytum); a heavy earth with a\n   specific gravity above 4.'),
(5985, 'Barytes', 'n.', 'Barium sulphate, generally called heavy spar or barite.\n   See Barite.'),
(5986, 'Barytic', 'a.', 'Of or pertaining to baryta.'),
(5987, 'Barytone', 'a.', 'Alt. of Baritone'),
(5988, 'Baritone', 'a.', 'Grave and deep, as a kind of male voice.'),
(5989, 'Baritone', 'a.', 'Not marked with an accent on the last syllable, the grave\n   accent being understood.'),
(5990, 'Barytone', 'n.', 'Alt. of Baritone'),
(5991, 'Baritone', 'n.', 'A male voice, the compass of which partakes of the common\n   bass and the tenor, but which does not descend as low as the one, nor\n   rise as high as the other.'),
(5992, 'Baritone', 'n.', 'A person having a voice of such range.'),
(5993, 'Baritone', 'n.', 'The viola di gamba, now entirely disused.'),
(5994, 'Baritone', 'n.', 'A word which has no accent marked on the last syllable,\n   the grave accent being understood.'),
(5995, 'Barytum', 'n.', 'The metal barium. See Barium.'),
(5996, 'Basal', 'a.', 'Relating to, or forming, the base.'),
(5997, 'Basalt', 'n.', 'A rock of igneous origin, consisting of augite and\n   triclinic feldspar, with grains of magnetic or titanic iron, and also\n   bottle-green particles of olivine frequently disseminated.'),
(5998, 'Basalt', 'n.', 'An imitation, in pottery, of natural basalt; a kind of\n   black porcelain.'),
(5999, 'Basaltic', 'a.', 'Pertaining to basalt; formed of, or containing, basalt;\n   as basaltic lava.'),
(6000, 'Basan', 'n.', 'Same as Basil, a sheepskin.'),
(6001, 'Basanite', 'n.', 'Lydian stone, or black jasper, a variety of siliceous or\n   flinty slate, of a grayish or bluish black color. It is employed to\n   test the purity of gold, the amount of alloy being indicated by the\n   color left on the stone when rubbed by the metal.'),
(6002, 'Basbleu', 'n.', 'A bluestocking; a literary woman.'),
(6003, 'Bascinet', 'n.', 'A light helmet, at first open, but later made with a\n   visor.'),
(6004, 'Bascule', 'n.', 'In mechanics an apparatus on the principle of the seesaw,\n   in which one end rises as the other falls.'),
(6005, 'Based', 'imp. & p. p.', 'of Base'),
(6006, 'Basing', 'p. pr. & vb. n.', 'of Base'),
(6007, 'Baseball', 'n.', 'A game of ball, so called from the bases or bounds ( four\n   in number) which designate the circuit which each player must endeavor\n   to make after striking the ball.'),
(6008, 'Baseball', 'n.', 'The ball used in this game.'),
(6009, 'Baseborn', 'a.', 'Born out of wedlock.'),
(6010, 'Baseborn', 'a.', 'Born of low parentage.'),
(6011, 'Baseborn', 'a.', 'Vile; mean.'),
(6012, 'Based', 'a.', 'Having a base, or having as a base; supported; as,\n   broad-based.'),
(6013, 'Based', 'n.', 'Wearing, or protected by, bases.'),
(6014, 'Baselard', 'n.', 'A short sword or dagger, worn in the fifteenth century.'),
(6015, 'Baseless', 'a.', 'Without a base; having no foundation or support.'),
(6016, 'Basely', 'adv.', 'In a base manner; with despicable meanness; dishonorably;\n   shamefully.'),
(6017, 'Basely', 'adv.', 'Illegitimately; in bastardy.'),
(6018, 'Basement', 'a.', 'The outer wall of the ground story of a building, or of a\n   part of that story, when treated as a distinct substructure. ( See\n   Base, n., 3 (a).) Hence: The rooms of a ground floor, collectively.'),
(6019, 'Baseness', 'n.', 'The quality or condition of being base; degradation;\n   vileness.'),
(6020, 'Basenet', 'n.', 'See Bascinet.'),
(6021, 'Bashaw', 'n.', 'A Turkish title of honor, now written pasha. See Pasha.'),
(6022, 'Bashaw', 'n.', 'Fig.: A magnate or grandee.'),
(6023, 'Bashaw', 'n.', 'A very large siluroid fish (Leptops olivaris) of the\n   Mississippi valley; -- also called goujon, mud cat, and yellow cat.'),
(6024, 'Bashful', 'a.', 'Abashed; daunted; dismayed.'),
(6025, 'Bashful', 'a.', 'Very modest, or modest excess; constitutionally disposed\n   to shrink from public notice; indicating extreme or excessive modesty;\n   shy; as, a bashful person, action, expression.'),
(6026, 'Bashless', 'a.', 'Shameless; unblushing.'),
(6027, 'Bashyle', 'n.', 'See Basyle.'),
(6028, 'Basi-', '', 'A combining form, especially in anatomical and botanical\n   words, to indicate the base or position at or near a base; forming a\n   base; as, basibranchials, the most ventral of the cartilages or bones\n   of the branchial arches; basicranial, situated at the base of the\n   cranium; basifacial, basitemporal, etc.'),
(6029, 'Basic', 'a.', 'Relating to a base; performing the office of a base in a\n   salt.'),
(6030, 'Basic', 'a.', 'Having the base in excess, or the amount of the base\n   atomically greater than that of the acid, or exceeding in proportion\n   that of the related neutral salt.'),
(6031, 'Basic', 'a.', 'Apparently alkaline, as certain normal salts which exhibit\n   alkaline reactions with test paper.'),
(6032, 'Basic', 'a.', 'Said of crystalline rocks which contain a relatively low\n   percentage of silica, as basalt.'),
(6033, 'Basicity', 'n.', 'The quality or state of being a base.'),
(6034, 'Basicity', 'n.', 'The power of an acid to unite with one or more atoms or\n   equivalents of a base, as indicated by the number of replaceable\n   hydrogen atoms contained in the acid.'),
(6035, 'Basidium', 'n.', 'A special oblong or pyriform cell, with slender branches,\n   which bears the spores in that division of fungi called Basidiomycetes,\n   of which the common mushroom is an example.'),
(6036, 'Basifier', 'n.', 'That which converts into a salifiable base.'),
(6037, 'Basify', 'v. t.', 'To convert into a salifiable base.'),
(6038, 'Basihyal', 'a.', 'Noting two small bones, forming the body of the inverted\n   hyoid arch.'),
(6039, 'Basil', 'n.', 'The slope or angle to which the cutting edge of a tool, as a\n   plane, is ground.'),
(6040, 'Basiled', 'imp. & p. p.', 'of Basil'),
(6041, 'Basiling', 'p. pr. & vb. n.', 'of Basil'),
(6042, 'Basil', 'v. t.', 'To grind or form the edge of to an angle.'),
(6043, 'Basil', 'n.', 'The name given to several aromatic herbs of the Mint family,\n   but chiefly to the common or sweet basil (Ocymum basilicum), and the\n   bush basil, or lesser basil (O. minimum), the leaves of which are used\n   in cookery. The name is also given to several kinds of mountain mint\n   (Pycnanthemum).'),
(6044, 'Basil', 'n.', 'The skin of a sheep tanned with bark.'),
(6045, 'Basilar', 'n.', 'Alt. of Basilary'),
(6046, 'Basilary', 'n.', 'Relating to, or situated at, the base.'),
(6047, 'Basilary', 'n.', 'Lower; inferior; applied to impulses or springs of\n   action.'),
(6048, 'Basilic', 'n.', 'Basilica.'),
(6049, 'Basilic', 'a.', 'Alt. of Basilical'),
(6050, 'Basilic/', 'pl. ', 'of Basilica'),
(6051, 'Basilica', 'n.', 'Originally, the place of a king; but afterward, an\n   apartment provided in the houses of persons of importance, where\n   assemblies were held for dispensing justice; and hence, any large hall\n   used for this purpose.'),
(6052, 'Basilica', 'n.', 'A building used by the Romans as a place of public\n   meeting, with court rooms, etc., attached.'),
(6053, 'Basilica', 'n.', 'A church building of the earlier centuries of\n   Christianity, the plan of which was taken from the basilica of the\n   Romans. The name is still applied to some churches by way of honorary\n   distinction.'),
(6054, 'Basilica', 'n.', 'A digest of the laws of Justinian, translated from the\n   original Latin into Greek, by order of Basil I., in the ninth century.'),
(6055, 'Basilisk', 'n.', 'A fabulous serpent, or dragon. The ancients alleged that\n   its hissing would drive away all other serpents, and that its breath,\n   and even its look, was fatal. See Cockatrice.'),
(6056, 'Basilisk', 'n.', 'A lizard of the genus Basiliscus, belonging to the family\n   Iguanidae.'),
(6057, 'Basilisk', 'n.', 'A large piece of ordnance, so called from its supposed\n   resemblance to the serpent of that name, or from its size.'),
(6058, 'Basin', 'n.', 'A hollow vessel or dish, to hold water for washing, and for\n   various other uses.'),
(6059, 'Basin', 'n.', 'The quantity contained in a basin.'),
(6060, 'Basin', 'n.', 'A hollow vessel, of various forms and materials, used in the\n   arts or manufactures, as that used by glass grinders for forming\n   concave glasses, by hatters for molding a hat into shape, etc.'),
(6061, 'Basin', 'n.', 'A hollow place containing water, as a pond, a dock for\n   ships, a little bay.'),
(6062, 'Basin', 'n.', 'A circular or oval valley, or depression of the surface of\n   the ground, the lowest part of which is generally occupied by a lake,\n   or traversed by a river.'),
(6063, 'Basin', 'n.', 'The entire tract of country drained by a river, or sloping\n   towards a sea or lake.'),
(6064, 'Basin', 'n.', 'An isolated or circumscribed formation, particularly where\n   the strata dip inward, on all sides, toward a center; -- especially\n   applied to the coal formations, called coal basins or coal fields.'),
(6065, 'Basined', 'a.', 'Inclosed in a basin.'),
(6066, 'Basinet', 'n.', 'Same as Bascinet.'),
(6067, 'Basion', 'n.', 'The middle of the anterior margin of the great foramen of\n   the skull.'),
(6068, 'Bases', 'pl. ', 'of Basis'),
(6069, 'Basis', 'n.', 'The foundation of anything; that on which a thing rests.'),
(6070, 'Basis', 'n.', 'The pedestal of a column, pillar, or statue.'),
(6071, 'Basis', 'n.', 'The ground work the first or fundamental principle; that\n   which supports.'),
(6072, 'Basis', 'n.', 'The principal component part of a thing.'),
(6073, 'Basked', 'imp. & p. p.', 'of Bask'),
(6074, 'Basking', 'p. pr. & vb. n.', 'of Bask'),
(6075, 'Basket', 'n.', 'A vessel made of osiers or other twigs, cane, rushes,\n   splints, or other flexible material, interwoven.'),
(6076, 'Basket', 'n.', 'The contents of a basket; as much as a basket contains; as,\n   a basket of peaches.'),
(6077, 'Basket', 'n.', 'The bell or vase of the Corinthian capital.'),
(6078, 'Basket', 'n.', 'The two back seats facing one another on the outside of a\n   stagecoach.'),
(6079, 'Basket', 'v. t.', 'To put into a basket.'),
(6080, 'Basketry', 'n.', 'The art of making baskets; also, baskets, taken\n   collectively.'),
(6081, 'Basnet', 'n.', 'Same as Bascinet.'),
(6082, 'Bason', 'n.', 'A basin.'),
(6083, 'Basque', 'a.', 'Pertaining to Biscay, its people, or their language.'),
(6084, 'Basque', 'n.', 'One of a race, of unknown origin, inhabiting a region on\n   the Bay of Biscay in Spain and France.'),
(6085, 'Basque', 'n.', 'The language spoken by the Basque people.'),
(6086, 'Basque', 'n.', 'A part of a lady\'s dress, resembling a jacket with a short\n   skirt; -- probably so called because this fashion of dress came from\n   the Basques.'),
(6087, 'Basquish', 'a.', 'Pertaining to the country, people, or language of Biscay;\n   Basque'),
(6088, 'Basses', 'pl. ', 'of Bass'),
(6089, 'Bassa', 'n.', 'Alt. of Bassaw'),
(6090, 'Bassaw', 'n.', 'See Bashaw.'),
(6091, 'Basset', 'n.', 'A game at cards, resembling the modern faro, said to have\n   been invented at Venice.'),
(6092, 'Basset', 'a.', 'Inclined upward; as, the basset edge of strata.'),
(6093, 'Basset', 'n.', 'The edge of a geological stratum at the surface of the\n   ground; the outcrop.'),
(6094, 'Basseted', 'imp. & p. p.', 'of Basset'),
(6095, 'Basset', 'v. i.', 'To inclined upward so as to appear at the surface; to\n   crop out; as, a vein of coal bassets.'),
(6096, 'Bassetto', 'n.', 'A tenor or small bass viol.'),
(6097, 'Bassinet', 'n.', 'A wicker basket, with a covering or hood over one end, in\n   which young children are placed as in a cradle.'),
(6098, 'Bassinet', 'n.', 'See Bascinet.'),
(6099, 'Basso', 'a.', 'The bass or lowest part; as, to sing basso.'),
(6100, 'Basso', 'a.', 'One who sings the lowest part.'),
(6101, 'Basso', 'a.', 'The double bass, or contrabasso.'),
(6102, 'Bassock', 'n.', 'A hassock. See 2d Bass, 2.'),
(6103, 'Bassoon', 'n.', 'A wind instrument of the double reed kind, furnished with\n   holes, which are stopped by the fingers, and by keys, as in flutes. It\n   forms the natural bass to the oboe, clarinet, etc.'),
(6104, 'Bassorin', 'n.', 'A constituent part of a species of gum from Bassora, as\n   also of gum tragacanth and some gum resins. It is one of the amyloses.'),
(6105, 'Basswood', 'n.', 'The bass (Tilia) or its wood; especially, T. Americana.\n   See Bass, the lime tree.'),
(6106, 'Basta', 'interj.', 'Enough; stop.'),
(6107, 'Bastard', 'n.', 'A \"natural\" child; a child begotten and born out of\n   wedlock; an illegitimate child; one born of an illicit union.'),
(6108, 'Bastard', 'n.', 'An inferior quality of soft brown sugar, obtained from the\n   sirups that / already had several boilings.'),
(6109, 'Bastard', 'n.', 'A large size of mold, in which sugar is drained.'),
(6110, 'Bastard', 'n.', 'A sweet Spanish wine like muscadel in flavor.'),
(6111, 'Bastard', 'n.', 'A writing paper of a particular size. See Paper.'),
(6112, 'Bastard', 'a.', 'Begotten and born out of lawful matrimony; illegitimate.\n   See Bastard, n., note.'),
(6113, 'Bastard', 'n.', 'Lacking in genuineness; spurious; false; adulterate; --\n   applied to things which resemble those which are genuine, but are\n   really not so.'),
(6114, 'Bastard', 'n.', 'Of an unusual make or proportion; as, a bastard musket; a\n   bastard culverin.'),
(6115, 'Bastard', 'n.', 'Abbreviated, as the half title in a page preceding the\n   full title page of a book.'),
(6116, 'Bastard', 'v. t.', 'To bastardize.'),
(6117, 'Bastardy', 'n.', 'The state of being a bastard; illegitimacy.'),
(6118, 'Bastardy', 'n.', 'The procreation of a bastard child.'),
(6119, 'Basted', 'imp. & p. p.', 'of Baste'),
(6120, 'Basting', 'p. pr. & vb. n.', 'of Baste'),
(6121, 'Baste', 'v. t.', 'To beat with a stick; to cudgel.'),
(6122, 'Baste', 'v. t.', 'To sprinkle flour and salt and drip butter or fat on, as\n   on meat in roasting.'),
(6123, 'Baste', 'v. t.', 'To mark with tar, as sheep.'),
(6124, 'Baste', 'v. t.', 'To sew loosely, or with long stitches; -- usually, that\n   the work may be held in position until sewed more firmly.'),
(6125, 'Bastion', 'n.', 'A work projecting outward from the main inclosure of a\n   fortification, consisting of two faces and two flanks, and so\n   constructed that it is able to defend by a flanking fire the adjacent\n   curtain, or wall which extends from one bastion to another. Two\n   adjacent bastions are connected by the curtain, which joins the flank\n   of one with the adjacent flank of the other. The distance between the\n   flanks of a bastion is called the gorge. A lunette is a detached\n   bastion. See Ravelin.'),
(6126, 'Basto', 'n.', 'The ace of clubs in quadrille and omber.'),
(6127, 'Baston', 'n.', 'A staff or cudgel.'),
(6128, 'Baston', 'n.', 'See Baton.'),
(6129, 'Baston', 'n.', 'An officer bearing a painted staff, who formerly was in\n   attendance upon the king\'s court to take into custody persons committed\n   by the court.'),
(6130, 'Basyle', 'n.', 'A positive or nonacid constituent of compound, either\n   elementary, or, if compound, performing the functions of an element.'),
(6131, 'Basylous', 'a.', 'Pertaining to, or having the nature of, a basyle;\n   electro-positive; basic; -- opposed to chlorous.'),
(6132, 'Batted', 'imp. & p. p.', 'of Bat'),
(6133, 'Batting', 'p. pr. & vb. n.', 'of Bat'),
(6134, 'Batable', 'a.', 'Disputable.'),
(6135, 'Batatas', 'n.', 'Alt. of Batata'),
(6136, 'Batata', 'n.', 'An aboriginal American name for the sweet potato (Ipomaea\n   batatas).'),
(6137, 'Batavian', 'a.', 'Of or pertaining to (a) the Batavi, an ancient Germanic\n   tribe; or to (b) /atavia or Holland; as, a Batavian legion.'),
(6138, 'Batavian', 'n.', 'A native or inhabitant of Batavia or Holland.'),
(6139, 'Batch', 'v. t.', 'The quantity of bread baked at one time.'),
(6140, 'Batch', 'v. t.', 'A quantity of anything produced at one operation; a group\n   or collection of persons or things of the same kind; as, a batch of\n   letters; the next batch of business.'),
(6141, 'Bated', 'imp. & p. p.', 'of Bate'),
(6142, 'Bating', 'p. pr. & vb. n.', 'of Bate'),
(6143, 'Bateaux', 'pl. ', 'of Bateau'),
(6144, 'Bateau', 'n.', 'A boat; esp. a flat-bottomed, clumsy boat used on the\n   Canadian lakes and rivers.'),
(6145, 'Bated', 'a.', 'Reduced; lowered; restrained; as, to speak with bated\n   breath.'),
(6146, 'Bateful', 'a.', 'Exciting contention; contentious.'),
(6147, 'Bateless', 'a.', 'Not to be abated.'),
(6148, 'Batement', 'n.', 'Abatement; diminution.'),
(6149, 'Batfish', 'n.', 'A name given to several species of fishes: (a) The Malthe\n   vespertilio of the Atlantic coast. (b) The flying gurnard of the\n   Atlantic (Cephalacanthus spinarella). (c) The California batfish or\n   sting ray (Myliobatis Californicus.)'),
(6150, 'Batful', 'v. i.', 'Rich; fertile.'),
(6151, 'Baths', 'pl. ', 'of Bath'),
(6152, 'Bathed', 'imp. & p. p.', 'of Bathe'),
(6153, 'Bathing', 'p. pr. & vb. n.', 'of Bathe'),
(6154, 'Bathe', 'v. t.', 'To wash by immersion, as in a bath; to subject to a bath.'),
(6155, 'Bathe', 'v. t.', 'To lave; to wet.'),
(6156, 'Bathe', 'v. t.', 'To moisten or suffuse with a liquid.'),
(6157, 'Bathe', 'v. t.', 'To apply water or some liquid medicament to; as, to bathe\n   the eye with warm water or with sea water; to bathe one\'s forehead with\n   camphor.'),
(6158, 'Bathe', 'v. t.', 'To surround, or envelop, as water surrounds a person\n   immersed.'),
(6159, 'Bathe', 'v. i.', 'To bathe one\'s self; to take a bath or baths.'),
(6160, 'Bathe', 'v. i.', 'To immerse or cover one\'s self, as in a bath.'),
(6161, 'Bathe', 'v. i.', 'To bask in the sun.'),
(6162, 'Bathe', 'n.', 'The immersion of the body in water; as to take one\'s usual\n   bathe.'),
(6163, 'Bather', 'n.', 'One who bathes.'),
(6164, 'Bathetic', 'a.', 'Having the character of bathos.'),
(6165, 'Bathing', 'n.', 'Act of taking a bath or baths.'),
(6166, 'Bathmism', 'n.', 'See Vital force.'),
(6167, 'Bathorse', 'n.', 'A horse which carries an officer\'s baggage during a\n   campaign.'),
(6168, 'Bathos', 'n.', 'A ludicrous descent from the elevated to the low, in\n   writing or speech; anticlimax.'),
(6169, 'Bating', 'prep.', 'With the exception of; excepting.'),
(6170, 'Batiste', 'n.', 'Originally, cambric or lawn of fine linen; now applied\n   also to cloth of similar texture made of cotton.'),
(6171, 'Batlet', 'n.', 'A short bat for beating clothes in washing them; -- called\n   also batler, batling staff, batting staff.'),
(6172, 'Batman', 'n.', 'A weight used in the East, varying according to the\n   locality; in Turkey, the greater batman is about 157 pounds, the lesser\n   only a fourth of this; at Aleppo and Smyrna, the batman is 17 pounds.'),
(6173, 'Batmen', 'pl. ', 'of Batman'),
(6174, 'Batman', 'n.', 'A man who has charge of a bathorse and his load.'),
(6175, 'Batoidei', 'n. pl.', 'The division of fishes which includes the rays and\n   skates.'),
(6176, 'Baton', 'n.', 'A staff or truncheon, used for various purposes; as, the\n   baton of a field marshal; the baton of a conductor in musical\n   performances.'),
(6177, 'Baton', 'n.', 'An ordinary with its ends cut off, borne sinister as a mark\n   of bastardy, and containing one fourth in breadth of the bend sinister;\n   -- called also bastard bar. See Bend sinister.'),
(6178, 'Batoon', 'n.', 'See Baton, and Baston.'),
(6179, 'Batsmen', 'pl. ', 'of Batsman'),
(6180, 'Batsman', 'n.', 'The one who wields the bat in cricket, baseball, etc.'),
(6181, 'Batwing', 'a.', 'Shaped like a bat\'s wing; as, a bat\'s-wing burner.'),
(6182, 'Batta', 'n.', 'Extra pay; esp. an extra allowance to an English officer\n   serving in India.'),
(6183, 'Batta', 'n.', 'Rate of exchange; also, the discount on uncurrent coins.'),
(6184, 'Battable', 'a.', 'Capable of cultivation; fertile; productive; fattening.'),
(6185, 'Battalia', 'n.', 'Order of battle; disposition or arrangement of troops\n   (brigades, regiments, battalions, etc.), or of a naval force, for\n   action.'),
(6186, 'Battalia', 'n.', 'An army in battle array; also, the main battalia or body.'),
(6187, 'Battel', 'n.', 'A single combat; as, trial by battel. See Wager of battel,\n   under Wager.'),
(6188, 'Battel', 'n.', 'Provisions ordered from the buttery; also, the charges for\n   them; -- only in the pl., except when used adjectively.'),
(6189, 'Battel', 'v. i.', 'To be supplied with provisions from the buttery.'),
(6190, 'Battel', 'v. i.', 'To make fertile.'),
(6191, 'Battel', 'a.', 'Fertile; fruitful; productive.'),
(6192, 'Batteler', 'n.', 'Alt. of Battler'),
(6193, 'Battler', 'n.', 'A student at Oxford who is supplied with provisions from\n   the buttery; formerly, one who paid for nothing but what he called for,\n   answering nearly to a sizar at Cambridge.'),
(6194, 'Battened', 'imp. & p. p.', 'of Batten'),
(6195, 'Batten', 'v. t.', 'To make fat by plenteous feeding; to fatten.'),
(6196, 'Batten', 'v. t.', 'To fertilize or enrich, as land.'),
(6197, 'Batten', 'v. i.', 'To grow fat; to grow fat in ease and luxury; to glut\n   one\'s self.'),
(6198, 'Batten', 'n .', 'A strip of sawed stuff, or a scantling; as, (a) pl. (Com.\n   & Arch.) Sawed timbers about 7 by 2 1/2 inches and not less than 6 feet\n   long. Brande & C. (b) (Naut.) A strip of wood used in fastening the\n   edges of a tarpaulin to the deck, also around masts to prevent chafing.\n   (c) A long, thin strip used to strengthen a part, to cover a crack,\n   etc.'),
(6199, 'Batten', 'v. t.', 'To furnish or fasten with battens.'),
(6200, 'Batten', 'v. t.', 'The movable bar of a loom, which strikes home or closes\n   the threads of a woof.'),
(6201, 'Battered', 'imp. & p. p.', 'of Batter'),
(6202, 'Batter', 'v. t.', 'To beat with successive blows; to beat repeatedly and\n   with violence, so as to bruise, shatter, or demolish; as, to batter a\n   wall or rampart.'),
(6203, 'Batter', 'v. t.', 'To wear or impair as if by beating or by hard usage.'),
(6204, 'Batter', 'v. t.', 'To flatten (metal) by hammering, so as to compress it\n   inwardly and spread it outwardly.'),
(6205, 'Batter', 'v. t.', 'A semi-liquid mixture of several ingredients, as, flour,\n   eggs, milk, etc., beaten together and used in cookery.'),
(6206, 'Batter', 'v. t.', 'Paste of clay or loam.'),
(6207, 'Batter', 'v. t.', 'A bruise on the face of a plate or of type in the form.'),
(6208, 'Batter', 'n.', 'A backward slope in the face of a wall or of a bank;\n   receding slope.'),
(6209, 'Batter', 'v. i.', 'To slope gently backward.'),
(6210, 'Batter', 'n.', 'One who wields a bat; a batsman.'),
(6211, 'Batterer', 'n.', 'One who, or that which, batters.'),
(6212, 'Battery', 'v. t.', 'The act of battering or beating.'),
(6213, 'Battery', 'v. t.', 'The unlawful beating of another. It includes every\n   willful, angry and violent, or negligent touching of another\'s person\n   or clothes, or anything attached to his person or held by him.'),
(6214, 'Battery', 'v. t.', 'Any place where cannon or mortars are mounted, for\n   attack or defense.'),
(6215, 'Battery', 'v. t.', 'Two or more pieces of artillery in the field.'),
(6216, 'Battery', 'v. t.', 'A company or division of artillery, including the\n   gunners, guns, horses, and all equipments. In the United States, a\n   battery of flying artillery consists usually of six guns.'),
(6217, 'Battery', 'v. t.', 'A number of coated jars (Leyden jars) so connected that\n   they may be charged and discharged simultaneously.'),
(6218, 'Battery', 'v. t.', 'An apparatus for generating voltaic electricity.'),
(6219, 'Battery', 'v. t.', 'A number of similar machines or devices in position; an\n   apparatus consisting of a set of similar parts; as, a battery of\n   boilers, of retorts, condensers, etc.'),
(6220, 'Battery', 'v. t.', 'A series of stamps operated by one motive power, for\n   crushing ores containing the precious metals.'),
(6221, 'Battery', 'v. t.', 'The box in which the stamps for crushing ore play up\n   and down.'),
(6222, 'Battery', 'v. t.', 'The pitcher and catcher together.'),
(6223, 'Batting', 'n.', 'The act of one who bats; the management of a bat in\n   playing games of ball.'),
(6224, 'Batting', 'n.', 'Cotton in sheets, prepared for use in making quilts, etc.;\n   as, cotton batting.'),
(6225, 'Battle', 'a.', 'Fertile. See Battel, a.'),
(6226, 'Battle', 'v. t.', 'A general action, fight, or encounter, in which all the\n   divisions of an army are or may be engaged; an engagement; a combat.'),
(6227, 'Battle', 'v. t.', 'A struggle; a contest; as, the battle of life.'),
(6228, 'Battle', 'v. t.', 'A division of an army; a battalion.'),
(6229, 'Battle', 'v. t.', 'The main body, as distinct from the van and rear;\n   battalia.'),
(6230, 'Battled', 'imp. & p. p.', 'of Battle'),
(6231, 'Battling', 'p. pr. & vb. n.', 'of Battle'),
(6232, 'Battle', 'n.', 'To join in battle; to contend in fight; as, to battle over\n   theories.'),
(6233, 'Battle', 'v. t.', 'To assail in battle; to fight.'),
(6234, 'Battled', 'p. p.', 'Embattled.'),
(6235, 'Batton', 'n.', 'See Batten, and Baton.'),
(6236, 'Battue', 'v. t.', 'The act of beating the woods, bushes, etc., for game.'),
(6237, 'Battue', 'v. t.', 'The game itself.'),
(6238, 'Battue', 'v. t.', 'The wanton slaughter of game.'),
(6239, 'Batture', 'n.', 'An elevated river bed or sea bed.'),
(6240, 'Battuta', 'n.', 'The measuring of time by beating.'),
(6241, 'Batty', 'a.', 'Belonging to, or resembling, a bat.'),
(6242, 'Batule', 'n.', 'A springboard in a circus or gymnasium; -- called also\n   batule board.'),
(6243, 'Batzen', 'pl. ', 'of Batz'),
(6244, 'Baubee', 'n.', 'Same as Bawbee.'),
(6245, 'Bauble', 'n.', 'A trifling piece of finery; a gewgaw; that which is gay and\n   showy without real value; a cheap, showy plaything.'),
(6246, 'Bauble', 'n.', 'The fool\'s club.'),
(6247, 'Baubling', 'a.', 'See Bawbling.'),
(6248, 'Baudekin', 'n.', 'The richest kind of stuff used in garments in the Middle\n   Ages, the web being gold, and the woof silk, with embroidery : -- made\n   originally at Bagdad.'),
(6249, 'Baudrick', 'n.', 'A belt. See Baldric.'),
(6250, 'Baulk', 'n. & v.', 'See Balk.'),
(6251, 'Bauxite', 'n.', 'Alt. of Beauxite'),
(6252, 'Beauxite', 'n.', 'A ferruginous hydrate of alumina. It is largely used in\n   the preparation of aluminium and alumina, and for the lining of\n   furnaces which are exposed to intense heat.'),
(6253, 'Bavarian', 'a.', 'Of or pertaining to Bavaria.'),
(6254, 'Bavarian', 'n.', 'A native or an inhabitant of Bavaria.'),
(6255, 'Bavaroy', 'n.', 'A kind of cloak or surtout.'),
(6256, 'Bavian', 'n.', 'A baboon.'),
(6257, 'Bavin', 'n.', 'A fagot of brushwood, or other light combustible matter, for\n   kindling fires; refuse of brushwood.'),
(6258, 'Bavin', 'n.', 'Impure limestone.'),
(6259, 'Bawbee', 'n.', 'A halfpenny.'),
(6260, 'Bawble', 'n.', 'A trinket. See Bauble.'),
(6261, 'Bawbling', 'a.', 'Insignificant; contemptible.'),
(6262, 'Bawcock', 'n.', 'A fine fellow; -- a term of endearment.'),
(6263, 'Bawdily', 'adv.', 'Obscenely; lewdly.'),
(6264, 'Bawdrick', 'n.', 'A belt. See Baldric.'),
(6265, 'Bawdry', 'n.', 'The practice of procuring women for the gratification of\n   lust.'),
(6266, 'Bawdry', 'n.', 'Illicit intercourse; fornication.'),
(6267, 'Bawdry', 'n.', 'Obscenity; filthy, unchaste language.'),
(6268, 'Bawdy', 'a.', 'Dirty; foul; -- said of clothes.'),
(6269, 'Bawdy', 'a.', 'Obscene; filthy; unchaste.'),
(6270, 'Bawhorse', 'n.', 'Same as Bathorse.'),
(6271, 'Bawled', 'imp. & p. p.', 'of Bawl'),
(6272, 'Bawling', 'p. pr. & vb. n.', 'of Bawl'),
(6273, 'Bawler', 'n.', 'One who bawls.'),
(6274, 'Bawrel', 'n.', 'A kind of hawk.'),
(6275, 'Bawsin', 'n.', 'Alt. of Bawson'),
(6276, 'Bawson', 'n.', 'A badger.'),
(6277, 'Bawson', 'n.', 'A large, unwieldy person.'),
(6278, 'Baxter', 'n.', 'A baker; originally, a female baker.'),
(6279, 'Bayed', 'imp. & p. p.', 'of Bay'),
(6280, 'Baying', 'p. pr. & vb. n.', 'of Bay'),
(6281, 'Bayad', 'n.', 'Alt. of Bayatte'),
(6282, 'Bayatte', 'n.', 'A large, edible, siluroid fish of the Nile, of two species\n   (Bagrina bayad and B. docmac).'),
(6283, 'Bayadere', 'n.', 'A female dancer in the East Indies.'),
(6284, 'Bayard', 'a.', 'Properly, a bay horse, but often any horse. Commonly in the\n   phrase blind bayard, an old blind horse.'),
(6285, 'Bayard', 'a.', 'A stupid, clownish fellow.'),
(6286, 'Bayardly', 'a.', 'Blind; stupid.'),
(6287, 'Bayberry', 'n.', 'The fruit of the bay tree or Laurus nobilis.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(6288, 'Bayberry', 'n.', 'A tree of the West Indies related to the myrtle (Pimenta\n   acris).'),
(6289, 'Bayberry', 'n.', 'The fruit of Myrica cerifera (wax myrtle); the shrub\n   itself; -- called also candleberry tree.'),
(6290, 'Baybolt', 'n.', 'A bolt with a barbed shank.'),
(6291, 'Bayed', 'a.', 'Having a bay or bays.'),
(6292, 'Bay ice', '', 'See under Ice.'),
(6293, 'Bay leaf', '', 'See under 3d Bay.'),
(6294, 'Bayonet', 'n.', 'A pointed instrument of the dagger kind fitted on the\n   muzzle of a musket or rifle, so as to give the soldier increased means\n   of offense and defense.'),
(6295, 'Bayonet', 'n.', 'A pin which plays in and out of holes made to receive it,\n   and which thus serves to engage or disengage parts of the machinery.'),
(6296, 'Bayonet', 'v. t.', 'To stab with a bayonet.'),
(6297, 'Bayonet', 'v. t.', 'To compel or drive by the bayonet.'),
(6298, 'Bayous', 'pl. ', 'of Bayou'),
(6299, 'Bayou', 'n.', 'An inlet from the Gulf of Mexico, from a lake, or from a\n   large river, sometimes sluggish, sometimes without perceptible movement\n   except from tide and wind.'),
(6300, 'Bay rum', '', 'A fragrant liquid, used for cosmetic and medicinal purposes.'),
(6301, 'Bayze', 'n.', 'See Baize.'),
(6302, 'Bay salt', '', 'Salt which has been obtained from sea water, by evaporation\n   in shallow pits or basins, by the heat of the sun; the large\n   crystalline salt of commerce.'),
(6303, 'Bay tree', '', 'A species of laurel. (Laurus nobilis).'),
(6304, 'Bay yarn', '', 'Woolen yarn.'),
(6305, 'Bazaar', 'n.', 'Alt. of Bazar'),
(6306, 'Bazar', 'n.', 'In the East, an exchange, marketplace, or assemblage of\n   shops where goods are exposed for sale.'),
(6307, 'Bazar', 'n.', 'A spacious hall or suite of rooms for the sale of goods, as\n   at a fair.'),
(6308, 'Bazar', 'n.', 'A fair for the sale of fancy wares, toys, etc., commonly for\n   a charitable objects.'),
(6309, 'Bdellium', 'n.', 'An unidentified substance mentioned in the Bible (Gen.\n   ii. 12, and Num. xi. 7), variously taken to be a gum, a precious stone,\n   or pearls, or perhaps a kind of amber found in Arabia.'),
(6310, 'Bdellium', 'n.', 'A gum resin of reddish brown color, brought from India,\n   Persia, and Africa.'),
(6311, 'Being', 'p. pr. & vb. n.', 'of Be'),
(6312, 'Beaches', 'pl. ', 'of Beach'),
(6313, 'Beach', 'n.', 'Pebbles, collectively; shingle.'),
(6314, 'Beach', 'n.', 'The shore of the sea, or of a lake, which is washed by the\n   waves; especially, a sandy or pebbly shore; the strand.'),
(6315, 'Beached', 'imp. & p. p.', 'of Beach'),
(6316, 'Beaching', 'p. pr. & vb. n.', 'of Beach'),
(6317, 'Beach', 'v. t.', 'To run or drive (as a vessel or a boat) upon a beach; to\n   strand; as, to beach a ship.'),
(6318, 'Beached', 'p. p. & a.', 'Bordered by a beach.'),
(6319, 'Beached', 'p. p. & a.', 'Driven on a beach; stranded; drawn up on a beach;\n   as, the ship is beached.'),
(6320, 'Beachy', 'a.', 'Having a beach or beaches; formed by a beach or beaches;\n   shingly.'),
(6321, 'Beacon', 'n.', 'A signal fire to notify of the approach of an enemy, or to\n   give any notice, commonly of warning.'),
(6322, 'Beacon', 'n.', 'A signal or conspicuous mark erected on an eminence near\n   the shore, or moored in shoal water, as a guide to mariners.'),
(6323, 'Beacon', 'n.', 'A high hill near the shore.'),
(6324, 'Beacon', 'n.', 'That which gives notice of danger.'),
(6325, 'Beaconed', 'imp. & p. p.', 'of Beacon'),
(6326, 'Beacon', 'v. t.', 'To give light to, as a beacon; to light up; to illumine.'),
(6327, 'Beacon', 'v. t.', 'To furnish with a beacon or beacons.'),
(6328, 'Beaded', 'imp. & p. p.', 'of Bead'),
(6329, 'Beading', 'p. pr. & vb. n.', 'of Bead'),
(6330, 'Beading', 'n.', 'Molding in imitation of beads.'),
(6331, 'Beading', 'n.', 'The beads or bead-forming quality of certain liquors; as,\n   the beading of a brand of whisky.'),
(6332, 'Beadle', 'v.', 'A messenger or crier of a court; a servitor; one who cites\n   or bids persons to appear and answer; -- called also an apparitor or\n   summoner.'),
(6333, 'Beadle', 'v.', 'An officer in a university, who precedes public processions\n   of officers and students.'),
(6334, 'Beadle', 'v.', 'An inferior parish officer in England having a variety of\n   duties, as the preservation of order in church service, the\n   chastisement of petty offenders, etc.'),
(6335, 'Beadlery', 'n.', 'Office or jurisdiction of a beadle.'),
(6336, 'Beadroll', 'n.', 'A catalogue of persons, for the rest of whose souls a\n   certain number of prayers are to be said or counted off on the beads of\n   a chaplet; hence, a catalogue in general.'),
(6337, 'Beadsman', 'n.', 'Alt. of Bedesman'),
(6338, 'Bedesman', 'n.', 'A poor man, supported in a beadhouse, and required to\n   pray for the soul of its founder; an almsman.'),
(6339, '-women', 'pl. ', 'of Bedeswoman'),
(6340, 'Beadwork', 'n.', 'Ornamental work in beads.'),
(6341, 'Beady', 'a.', 'Resembling beads; small, round, and glistening.'),
(6342, 'Beady', 'a.', 'Covered or ornamented with, or as with, beads.'),
(6343, 'Beady', 'a.', 'Characterized by beads; as, beady liquor.'),
(6344, 'Beagle', 'n.', 'A small hound, or hunting dog, twelve to fifteen inches\n   high, used in hunting hares and other small game. See Illustration in\n   Appendix.'),
(6345, 'Beagle', 'n.', 'Fig.: A spy or detective; a constable.'),
(6346, 'Beaked', 'a.', 'Having a beak or a beaklike point; beak-shaped.'),
(6347, 'Beaked', 'a.', 'Furnished with a process or a mouth like a beak; rostrate.'),
(6348, 'Beaker', 'n.', 'A large drinking cup, with a wide mouth, supported on a\n   foot or standard.'),
(6349, 'Beaker', 'n.', 'An open-mouthed, thin glass vessel, having a projecting lip\n   for pouring; -- used for holding solutions requiring heat.'),
(6350, 'Beakhead', 'n.', 'An ornament used in rich Norman doorways, resembling a\n   head with a beak.'),
(6351, 'Beakhead', 'n.', 'A small platform at the fore part of the upper deck of a\n   vessel, which contains the water closets of the crew.'),
(6352, 'Beakhead', 'n.', 'Same as Beak, 3.'),
(6353, 'Beakiron', 'n.', 'A bickern; a bench anvil with a long beak, adapted to\n   reach the interior surface of sheet metal ware; the horn of an anvil.'),
(6354, 'Bealed', 'imp. & p. p.', 'of Beal'),
(6355, 'Bealing', 'p. pr & vb. n.', 'of Beal'),
(6356, 'Be-all', 'n.', 'The whole; all that is to be.'),
(6357, 'Beamed', 'imp. & p. p.', 'of Beam'),
(6358, 'Beaming', 'p. pr. & vb. n.', 'of Beam'),
(6359, 'Beambird', 'n.', 'A small European flycatcher (Muscicapa gricola), so\n   called because it often nests on a beam in a building.'),
(6360, 'Beamed', 'a.', 'Furnished with beams, as the head of a stag.'),
(6361, 'Beamful', 'a.', 'Beamy; radiant.'),
(6362, 'Beamily', 'adv.', 'In a beaming manner.'),
(6363, 'Beaming', 'a.', 'Emitting beams; radiant.'),
(6364, 'Beamless', 'a.', 'Not having a beam.'),
(6365, 'Beamless', 'a.', 'Not emitting light.'),
(6366, 'Beamlet', 'n.', 'A small beam of light.'),
(6367, 'Beamy', 'a.', 'Emitting beams of light; radiant; shining.'),
(6368, 'Beamy', 'a.', 'Resembling a beam in size and weight; massy.'),
(6369, 'Beamy', 'a.', 'Having horns, or antlers.'),
(6370, 'Borne', '', 'of Bear'),
(6371, 'Bearing', 'p. pr. & vb. n.', 'of Bear'),
(6372, 'Bearable', 'a.', 'Capable of being borne or endured; tolerable.'),
(6373, 'Bearbind', 'n.', 'The bindweed (Convolvulus arvensis).'),
(6374, 'Beard', 'n.', 'The hair that grows on the chin, lips, and adjacent parts of\n   the human face, chiefly of male adults.'),
(6375, 'Beard', 'n.', 'The long hairs about the face in animals, as in the goat.'),
(6376, 'Beard', 'n.', 'The cluster of small feathers at the base of the beak in\n   some birds'),
(6377, 'Beard', 'n.', 'The appendages to the jaw in some Cetacea, and to the mouth\n   or jaws of some fishes.'),
(6378, 'Beard', 'n.', 'The byssus of certain shellfish, as the muscle.'),
(6379, 'Beard', 'n.', 'The gills of some bivalves, as the oyster.'),
(6380, 'Beard', 'n.', 'In insects, the hairs of the labial palpi of moths and\n   butterflies.'),
(6381, 'Beard', 'n.', 'Long or stiff hairs on a plant; the awn; as, the beard of\n   grain.'),
(6382, 'Beard', 'n.', 'A barb or sharp point of an arrow or other instrument,\n   projecting backward to prevent the head from being easily drawn out.'),
(6383, 'Beard', 'n.', 'That part of the under side of a horse\'s lower jaw which is\n   above the chin, and bears the curb of a bridle.'),
(6384, 'Beard', 'n.', 'That part of a type which is between the shoulder of the\n   shank and the face.'),
(6385, 'Beard', 'n.', 'An imposition; a trick.'),
(6386, 'Bearded', 'imp. & p. p.', 'of Beard'),
(6387, 'Bearding', 'p. pr. & vb. n.', 'of Beard'),
(6388, 'Beard', 'v. t.', 'To take by the beard; to seize, pluck, or pull the beard\n   of (a man), in anger or contempt.'),
(6389, 'Beard', 'v. t.', 'To oppose to the gills; to set at defiance.'),
(6390, 'Beard', 'v. t.', 'To deprive of the gills; -- used only of oysters and\n   similar shellfish.'),
(6391, 'Bearded', 'a.', 'Having a beard.'),
(6392, 'Beardie', 'n.', 'The bearded loach (Nemachilus barbatus) of Europe.'),
(6393, 'Bearer', 'n.', 'One who, or that which, bears, sustains, or carries.'),
(6394, 'Bearer', 'n.', 'Specifically: One who assists in carrying a body to the\n   grave; a pallbearer.'),
(6395, 'Bearer', 'n.', 'A palanquin carrier; also, a house servant.'),
(6396, 'Bearer', 'n.', 'A tree or plant yielding fruit; as, a good bearer.'),
(6397, 'Bearer', 'n.', 'One who holds a check, note, draft, or other order for the\n   payment of money; as, pay to bearer.'),
(6398, 'Bearer', 'n.', 'A strip of reglet or other furniture to bear off the\n   impression from a blank page; also, a type or type-high piece of metal\n   interspersed in blank parts to support the plate when it is shaved.'),
(6399, 'Bearherd', 'n.', 'A man who tends a bear.'),
(6400, 'Bearing', 'n.', 'The manner in which one bears or conducts one\'s self;\n   mien; behavior; carriage.'),
(6401, 'Bearing', 'n.', 'Patient endurance; suffering without complaint.'),
(6402, 'Bearing', 'n.', 'The situation of one object, with respect to another, such\n   situation being supposed to have a connection with the object, or\n   influence upon it, or to be influenced by it; hence, relation;\n   connection.'),
(6403, 'Bearing', 'n.', 'Purport; meaning; intended significance; aspect.'),
(6404, 'Bearing', 'n.', 'The act, power, or time of producing or giving birth; as,\n   a tree in full bearing; a tree past bearing.'),
(6405, 'Bearing', 'n.', 'That part of any member of a building which rests upon its\n   supports; as, a lintel or beam may have four inches of bearing upon the\n   wall.'),
(6406, 'Bearing', 'n.', 'The portion of a support on which anything rests.'),
(6407, 'Bearing', 'n.', 'Improperly, the unsupported span; as, the beam has twenty\n   feet of bearing between its supports.'),
(6408, 'Bearing', 'n.', 'The part of an axle or shaft in contact with its support,\n   collar, or boxing; the journal.'),
(6409, 'Bearing', 'n.', 'The part of the support on which a journal rests and\n   rotates.'),
(6410, 'Bearing', 'n.', 'Any single emblem or charge in an escutcheon or coat of\n   arms -- commonly in the pl.'),
(6411, 'Bearing', 'n.', 'The situation of a distant object, with regard to a ship\'s\n   position, as on the bow, on the lee quarter, etc.; the direction or\n   point of the compass in which an object is seen; as, the bearing of the\n   cape was W. N. W.'),
(6412, 'Bearing', 'n.', 'The widest part of a vessel below the plank-sheer.'),
(6413, 'Bearing', 'n.', 'The line of flotation of a vessel when properly trimmed\n   with cargo or ballast.'),
