(6851, 'Belief', 'n.', 'Assent to a proposition or affirmation, or the acceptance\n   of a fact, opinion, or assertion as real or true, without immediate\n   personal knowledge; reliance upon word or testimony; partial or full\n   assurance without positive knowledge or absolute certainty; persuasion;\n   conviction; confidence; as, belief of a witness; the belief of our\n   senses.'),
(6852, 'Belief', 'n.', 'A persuasion of the truths of religion; faith.'),
(6853, 'Belief', 'n.', 'The thing believed; the object of belief.'),
(6854, 'Belief', 'n.', 'A tenet, or the body of tenets, held by the advocates of\n   any class of views; doctrine; creed.'),
(6855, 'Believed', 'imp. & p. p.', 'of Believe'),
(6856, 'Believe', 'n.', 'To exercise belief in; to credit upon the authority or\n   testimony of another; to be persuaded of the truth of, upon evidence\n   furnished by reasons, arguments, and deductions of the mind, or by\n   circumstances other than personal knowledge; to regard or accept as\n   true; to place confidence in; to think; to consider; as, to believe a\n   person, a statement, or a doctrine.'),
(6857, 'Believe', 'v. i.', 'To have a firm persuasion, esp. of the truths of\n   religion; to have a persuasion approaching to certainty; to exercise\n   belief or faith.'),
(6858, 'Believe', 'v. i.', 'To think; to suppose.'),
(6859, 'Believer', 'n.', 'One who believes; one who is persuaded of the truth or\n   reality of some doctrine, person, or thing.'),
(6860, 'Believer', 'n.', 'One who gives credit to the truth of the Scriptures, as a\n   revelation from God; a Christian; -- in a more restricted sense, one\n   who receives Christ as his Savior, and accepts the way of salvation\n   unfolded in the gospel.'),
(6861, 'Believer', 'n.', 'One who was admitted to all the rights of divine worship\n   and instructed in all the mysteries of the Christian religion, in\n   distinction from a catechumen, or one yet under instruction.'),
(6862, 'Belight', 'v. t.', 'To illuminate.'),
