(6877, 'Belling', 'n.', 'A bellowing, as of a deer in rutting time.'),
(6878, 'Bell jar', '', 'A glass vessel, varying in size, open at the bottom and\n   closed at the top like a bell, and having a knob or handle at the top\n   for lifting it. It is used for a great variety of purposes; as, with\n   the air pump, and for holding gases, also for keeping the dust from\n   articles exposed to view.'),
(6879, 'Bellman', 'n.', 'A man who rings a bell, especially to give notice of\n   anything in the streets. Formerly, also, a night watchman who called\n   the hours.'),
(6880, 'Bellon', 'n.', 'Lead colic.'),
(6881, 'Bellona', 'n.', 'The goddess of war.'),
(6882, 'Bellowed', 'imp. & p. p.', 'of Bellow'),
(6883, 'Bellow', 'v.', 'To make a hollow, loud noise, as an enraged bull.'),
(6884, 'Bellow', 'v.', 'To bowl; to vociferate; to clamor.'),
(6885, 'Bellow', 'v.', 'To roar; as the sea in a tempest, or as the wind when\n   violent; to make a loud, hollow, continued sound.'),
(6886, 'Bellow', 'v. t.', 'To emit with a loud voice; to shout; -- used with out.'),
(6887, 'Bellow', 'n.', 'A loud resounding outcry or noise, as of an enraged bull; a\n   roar.'),
(6888, 'Bellower', 'n.', 'One who, or that which, bellows.'),
(6889, 'Bellows', 'n. sing. & pl.', 'An instrument, utensil, or machine, which, by\n   alternate expansion and contraction, or by rise and fall of the top,\n   draws in air through a valve and expels it through a tube for various\n   purposes, as blowing fires, ventilating mines, or filling the pipes of\n   an organ with wind.'),
(6890, 'Belluine', 'a.', 'Pertaining to, or like, a beast; brutal.'),
(6891, 'Bellwort', 'n.', 'A genus of plants (Uvularia) with yellowish bell-shaped\n   flowers.'),
(6892, 'Bellies', 'pl. ', 'of Belly'),
(6893, 'Belly', 'n.', 'That part of the human body which extends downward from the\n   breast to the thighs, and contains the bowels, or intestines; the\n   abdomen.'),
(6894, 'Belly', 'n.', 'The under part of the body of animals, corresponding to the\n   human belly.'),
(6895, 'Belly', 'n.', 'The womb.'),
(6896, 'Belly', 'n.', 'The part of anything which resembles the human belly in\n   protuberance or in cavity; the innermost part; as, the belly of a\n   flask, muscle, sail, ship.'),
(6897, 'Belly', 'n.', 'The hollow part of a curved or bent timber, the convex part\n   of which is the back.'),
(6898, 'Bellied', 'imp. & p. p.', 'of Belly'),
(6899, 'Bellying', 'p. pr. & vb. n.', 'of Belly'),
(6900, 'Belly', 'v. t.', 'To cause to swell out; to fill.'),
(6901, 'Belly', 'v. i.', 'To swell and become protuberant, like the belly; to\n   bulge.');
