(7444, 'Bezant', 'n.', 'A gold coin of Byzantium or Constantinople, varying in\n   weight and value, usually (those current in England) between a\n   sovereign and a half sovereign. There were also white or silver\n   bezants.'),
(7445, 'Bezant', 'n.', 'A circle in or, i. e., gold, representing the gold coin\n   called bezant.'),
(7446, 'Bezant', 'n.', 'A decoration of a flat surface, as of a band or belt,\n   representing circular disks lapping one upon another.'),
(7447, 'Bezel', 'n.', 'The rim which encompasses and fastens a jewel or other\n   object, as the crystal of a watch, in the cavity in which it is set.'),
(7448, 'Bezique', 'n.', 'A game at cards in which various combinations of cards in\n   the hand, when declared, score points.'),
(7449, 'Bezoar', 'n.', 'A calculous concretion found in the intestines of certain\n   ruminant animals (as the wild goat, the gazelle, and the Peruvian\n   llama) formerly regarded as an unfailing antidote for poison, and a\n   certain remedy for eruptive, pestilential, or putrid diseases. Hence:\n   Any antidote or panacea.'),
(7450, 'Bezonian', 'n.', 'A low fellow or scoundrel; a beggar.'),
(7451, 'Bezzled', 'imp. & p. p.', 'of Bezzle'),
(7452, 'Bezzling', 'p. pr. & vb. n.', 'of Bezzle'),
(7453, 'Bezzle', 'v. t.', 'To plunder; to waste in riot.'),
(7454, 'Bezzle', 'v. i.', 'To drink to excess; to revel.'),
(7455, 'Bhang', 'n.', 'An astringent and narcotic drug made from the dried leaves\n   and seed capsules of wild hemp (Cannabis Indica), and chewed or smoked\n   in the East as a means of intoxication. See Hasheesh.'),
(7456, 'Bhunder', 'n.', 'An Indian monkey (Macacus Rhesus), protected by the\n   Hindoos as sacred. See Rhesus.'),
(7457, 'Biacid', 'a.', 'Having two hydrogen atoms which can be replaced by negative\n   atoms or radicals to form salts; -- said of bases. See Diacid.'),
(7458, 'Biases', 'pl. ', 'of Bias'),
(7459, 'Biased', 'imp. & p. p.', 'of Bias'),
(7460, 'Biasing', 'p. pr. & vb. n.', 'of Bias'),
(7461, 'Biaxal', 'a.', 'Alt. of Biaxial'),
(7462, 'Biaxial', 'a.', 'Having two axes; as, biaxial polarization.'),
(7463, 'Bibbe', 'v. t.', 'To drink; to tipple.'),
(7464, 'Bibacity', 'n.', 'The practice or habit of drinking too much; tippling.'),
(7465, 'Bibasic', 'a.', 'Having to hydrogen atoms which can be replaced by positive\n   or basic atoms or radicals to form salts; -- said of acids. See\n   Dibasic.'),
(7466, 'Bibber', 'n.', 'One given to drinking alcoholic beverages too freely; a\n   tippler; -- chiefly used in composition; as, winebibber.'),
(7467, 'Bibbs', 'n. pl.', 'Pieces of timber bolted to certain parts of a mast to\n   support the trestletrees.'),
(7468, 'Bibcock', 'n.', 'A cock or faucet having a bent down nozzle.'),
(7469, 'Bibirine', 'n.', 'See Bebeerine.'),
(7470, 'Bibitory', 'a.', 'Of or pertaining to drinking or tippling.'),
(7471, 'Bible', 'n.', 'A book.'),
(7472, 'Bible', 'n.', 'The Book by way of eminence, -- that is, the book which is\n   made up of the writings accepted by Christians as of divine origin and\n   authority, whether such writings be in the original language, or\n   translated; the Scriptures of the Old and New Testaments; -- sometimes\n   in a restricted sense, the Old Testament; as, King James\'s Bible; Douay\n   Bible; Luther\'s Bible. Also, the book which is made up of writings\n   similarly accepted by the Jews; as, a rabbinical Bible.'),
(7473, 'Bible', 'n.', 'A book containing the sacred writings belonging to any\n   religion; as, the Koran is often called the Mohammedan Bible.'),
(7474, 'Bible', 'n.', 'A book with an authoritative exposition of some topic,\n   respected by many who are experts in the field.'),
(7475, 'Bibler', 'v. t.', 'A great drinker; a tippler.'),
(7476, 'Biblical', 'a.', 'Pertaining to, or derived from, the Bible; as, biblical\n   learning; biblical authority.'),
(7477, 'Biblist', 'n.', 'One who makes the Bible the sole rule of faith.'),
(7478, 'Biblist', 'n.', 'A biblical scholar; a biblicist.'),
(7479, 'Bibulous', 'v. t.', 'Readily imbibing fluids or moisture; spongy; as,\n   bibulous blotting paper.'),
(7480, 'Bibulous', 'v. t.', 'Inclined to drink; addicted to tippling.'),
(7481, '-retted', 'a.', 'Containing two atoms or equivalents of carbon in the\n   molecule.'),
(7482, 'Bicaudal', 'a.', 'Having, or terminating in, two tails.'),
(7483, 'Bicched', 'a.', 'Pecked; pitted; notched.'),
(7484, 'Biceps', 'n.', 'A muscle having two heads or origins; -- applied\n   particularly to a flexor in the arm, and to another in the thigh.'),
(7485, 'Bichir', 'n.', 'A remarkable ganoid fish (Polypterus bichir) found in the\n   Nile and other African rivers. See Brachioganoidei.'),
(7486, 'Bicho', 'n.', 'See Jigger.'),
(7487, 'Bicker', 'n.', 'A small wooden vessel made of staves and hoops, like a tub.'),
(7488, 'Bickered', 'imp. & p. p.', 'of Bicker'),
(7489, 'Bicker', 'v. i.', 'To skirmish; to exchange blows; to fight.'),
(7490, 'Bicker', 'v. i.', 'To contend in petulant altercation; to wrangle.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(7491, 'Bicker', 'v. i.', 'To move quickly and unsteadily, or with a pattering\n   noise; to quiver; to be tremulous, like flame.'),
(7492, 'Bicker', 'n.', 'A skirmish; an encounter.'),
(7493, 'Bicker', 'n.', 'A fight with stones between two parties of boys.'),
(7494, 'Bicker', 'n.', 'A wrangle; also, a noise,, as in angry contention.'),
(7495, 'Bickerer', 'n.', 'One who bickers.'),
(7496, 'Bickern', 'n.', 'An anvil ending in a beak or point (orig. in two beaks);\n   also, the beak or horn itself.'),
(7497, 'Bicolor', 'a.', 'Alt. of Bicolored'),
(7498, 'Biconvex', 'a.', 'Convex on both sides; as, a biconvex lens.'),
(7499, 'Bicorn', 'a.', 'Alt. of Bicornous'),
(7500, 'Bicorned', 'a.', 'Alt. of Bicornous'),
(7501, 'Bicrural', 'a.', 'Having two legs.'),
(7502, 'Bicuspid', 'a.', 'Alt. of Bicuspidate'),
(7503, 'Bicuspid', 'n.', 'One of the two double-pointed teeth which intervene\n   between the canines (cuspids) and the molars, on each side of each jaw.\n   See Tooth, n.'),
(7504, 'Bicycle', 'n.', 'A light vehicle having two wheels one behind the other. It\n   has a saddle seat and is propelled by the rider\'s feet acting on cranks\n   or levers.'),
(7505, 'Bicycler', 'n.', 'One who rides a bicycle.'),
(7506, 'Bicyclic', 'a.', 'Relating to bicycles.'),
(7507, 'Bidden', 'p. p.', 'of Bid'),
(7508, 'Bidding', 'p. pr. & vb. n.', 'of Bid'),
(7509, 'Bidale', 'n.', 'An invitation of friends to drink ale at some poor man\'s\n   house, and there to contribute in charity for his relief.'),
(7510, 'Biddable', 'a.', 'Obedient; docile.'),
(7511, 'Bidden', '', 'p. p. of Bid.'),
(7512, 'Bidder', 'n.', 'One who bids or offers a price.'),
(7513, 'Bidding', 'n.', 'Command; order; a proclamation or notifying.'),
(7514, 'Bidding', 'n.', 'The act or process of making bids; an offer; a proposal of\n   a price, as at an auction.'),
(7515, 'Biddy', 'n.', 'A name used in calling a hen or chicken.'),
(7516, 'Biddy', 'n.', 'An Irish serving woman or girl.'),
(7517, 'Bided', 'imp. & p. p.', 'of Bide'),
(7518, 'Biding', 'p. pr. & vb. n.', 'of Bide'),
(7519, 'Bident', 'n.', 'An instrument or weapon with two prongs.'),
(7520, 'Bidental', 'a.', 'Having two teeth.'),
(7521, 'Bidet', 'n.', 'A small horse formerly allowed to each trooper or dragoon\n   for carrying his baggage.'),
(7522, 'Bidet', 'n.', 'A kind of bath tub for sitting baths; a sitz bath.'),
(7523, 'Biding', 'n.', 'Residence; habitation.'),
(7524, 'Bield', 'n.', 'A shelter. Same as Beild.'),
(7525, 'Bield', 'v. t.', 'To shelter.'),
(7526, 'Biennial', 'a.', 'Happening, or taking place, once in two years; as, a\n   biennial election.'),
(7527, 'Biennial', 'a.', 'Continuing for two years, and then perishing, as plants\n   which form roots and leaves the first year, and produce fruit the\n   second.'),
(7528, 'Biennial', 'n.', 'Something which takes place or appears once in two years;\n   esp. a biennial examination.'),
(7529, 'Biennial', 'n.', 'A plant which exists or lasts for two years.'),
(7530, 'Bierbalk', 'n.', 'A church road (e. g., a path across fields) for funerals.'),
(7531, 'Bifacial', 'a.', 'Having the opposite surfaces alike.'),
(7532, 'Biferous', 'a.', 'Bearing fruit twice a year.'),
(7533, 'Biffin', 'n.', 'A sort of apple peculiar to Norfolk, Eng.'),
(7534, 'Biffin', 'n.', 'A baked apple pressed down into a flat, round cake; a dried\n   apple.'),
(7535, 'Bifid', 'a.', 'Cleft to the middle or slightly beyond the middle; opening\n   with a cleft; divided by a linear sinus, with straight margins.'),
(7536, 'Bifidate', 'a.', 'See Bifid.'),
(7537, 'Bifilar', 'a.', 'Two-threaded; involving the use of two threads; as,\n   bifilar suspension; a bifilar balance.'),
(7538, 'Bifold', 'a.', 'Twofold; double; of two kinds, degrees, etc.'),
(7539, 'Biforate', 'a.', 'Having two perforations.'),
(7540, 'Biforine', 'n.', 'An oval sac or cell, found in the leaves of certain\n   plants of the order Araceae. It has an opening at each end through\n   which raphides, generated inside, are discharged.'),
(7541, 'Biforked', 'a.', 'Bifurcate.'),
(7542, 'Biform', 'a.', 'Having two forms, bodies, or shapes.'),
(7543, 'Biformed', 'a.', 'Having two forms.'),
(7544, 'Biforn', 'prep. & adv.', 'Before.'),
(7545, 'Biforous', 'a.', 'See Biforate.'),
(7546, 'Bigam', 'n.', 'A bigamist.'),
(7547, 'Bigamist', 'n.', 'One who is guilty of bigamy.'),
(7548, 'Bigamous', 'a.', 'Guilty of bigamy; involving bigamy; as, a bigamous\n   marriage.'),
(7549, 'Bigamy', 'n.', 'The offense of marrying one person when already legally\n   married to another.'),
(7550, 'Bigaroon', 'n.', 'The large white-heart cherry.'),
(7551, 'Bigeye', 'n.', 'A fish of the genus Priacanthus, remarkable for the large\n   size of the eye.'),
(7552, 'Biggen', 'v. t. & i.', 'To make or become big; to enlarge.'),
(7553, 'Bigger', 'a.', 'compar. of Big.'),
(7554, 'Biggest', 'a.', 'superl. of Big.'),
(7555, 'Biggin', 'n.', 'A child\'s cap; a hood, or something worn on the head.'),
(7556, 'Biggin', 'n.', 'A coffeepot with a strainer or perforated metallic vessel\n   for holding the ground coffee, through which boiling water is poured;\n   -- so called from Mr. Biggin, the inventor.'),
(7557, 'Biggin', 'v. t.', 'Alt. of Bigging'),
(7558, 'Bigging', 'v. t.', 'A building.'),
(7559, 'Biggon', 'n.', 'Alt. of Biggonnet'),
(7560, 'Bigha', 'n.', 'A measure of land in India, varying from a third of an acre\n   to an acre.'),
(7561, 'Bighorn', 'n.', 'The Rocky Mountain sheep (Ovis / Caprovis montana).'),
(7562, 'Bight', 'v.', 'A corner, bend, or angle; a hollow; as, the bight of a\n   horse\'s knee; the bight of an elbow.'),
(7563, 'Bight', 'v.', 'A bend in a coast forming an open bay; as, the Bight of\n   Benin.'),
(7564, 'Bight', 'v.', 'The double part of a rope when folded, in distinction from\n   the ends; that is, a round, bend, or coil not including the ends; a\n   loop.'),
(7565, 'Bigly', 'a.', 'In a tumid, swelling, blustering manner; haughtily;\n   violently.'),
(7566, 'Bigness', 'n.', 'The state or quality of being big; largeness; size; bulk.'),
(7567, 'Bignonia', 'n.', 'A large genus of American, mostly tropical, climbing\n   shrubs, having compound leaves and showy somewhat tubular flowers. B.\n   capreolata is the cross vine of the Southern United States. The trumpet\n   creeper was formerly considered to be of this genus.'),
(7568, 'Bigot', 'n.', 'A hypocrite; esp., a superstitious hypocrite.'),
(7569, 'Bigot', 'n.', 'A person who regards his own faith and views in matters of\n   religion as unquestionably right, and any belief or opinion opposed to\n   or differing from them as unreasonable or wicked. In an extended sense,\n   a person who is intolerant of opinions which conflict with his own, as\n   in politics or morals; one obstinately and blindly devoted to his own\n   church, party, belief, or opinion.'),
(7570, 'Bigot', 'a.', 'Bigoted.'),
(7571, 'Bigoted', 'a.', 'Obstinately and blindly attached to some creed, opinion\n   practice, or ritual; unreasonably devoted to a system or party, and\n   illiberal toward the opinions of others.'),
(7572, 'Bigotry', 'n.', 'The state of mind of a bigot; obstinate and unreasoning\n   attachment of one\'s own belief and opinions, with narrow-minded\n   intolerance of beliefs opposed to them.'),
(7573, 'Bigotry', 'n.', 'The practice or tenets of a bigot.'),
(7574, 'Bigwig', 'a.', 'A person of consequence; as, the bigwigs of society.'),
(7575, 'Bijoux', 'pl. ', 'of Bijou'),
(7576, 'Bijou', 'n.', 'A trinket; a jewel; -- a word applied to anything small and\n   of elegant workmanship.'),
(7577, 'Bijoutry', 'n.', 'Small articles of virtu, as jewelry, trinkets, etc.'),
(7578, 'Bijugate', 'a.', 'Having two pairs, as of leaflets.'),
(7579, 'Bijugous', 'a.', 'Bijugate.'),
(7580, 'Bilalo', 'n.', 'A two-masted passenger boat or small vessel, used in the\n   bay of Manila.'),
(7581, 'Biland', 'n.', 'A byland.'),
(7582, 'Bilander', 'n.', 'A small two-masted merchant vessel, fitted only for\n   coasting, or for use in canals, as in Holland.'),
(7583, 'Bilberry', 'n.', 'The European whortleberry (Vaccinium myrtillus); also,\n   its edible bluish black fruit.'),
(7584, 'Bilberry', 'n.', 'Any similar plant or its fruit; esp., in America, the\n   species Vaccinium myrtilloides, V. caespitosum and V. uliginosum.'),
(7585, 'Bilboes', 'pl. ', 'of Bilbo'),
(7586, 'Bilbo', 'n.', 'A rapier; a sword; so named from Bilbao, in Spain.'),
(7587, 'Bilbo', 'n.', 'A long bar or bolt of iron with sliding shackles, and a lock\n   at the end, to confine the feet of prisoners or offenders, esp. on\n   board of ships.'),
(7588, 'Bilcock', 'n.', 'The European water rail.'),
(7589, 'Bilge', 'n.', 'The protuberant part of a cask, which is usually in the\n   middle.'),
(7590, 'Bilge', 'n.', 'That part of a ship\'s hull or bottom which is broadest and\n   most nearly flat, and on which she would rest if aground.'),
(7591, 'Bilge', 'n.', 'Bilge water.'),
(7592, 'Bilged', 'imp. & p. p.', 'of Bilge'),
(7593, 'Bilging', 'p. pr. & vb. n.', 'of Bilge'),
(7594, 'Bilge', 'v. i.', 'To suffer a fracture in the bilge; to spring a leak by a\n   fracture in the bilge.'),
(7595, 'Bilge', 'v. i.', 'To bulge.'),
(7596, 'Bilge', 'v. t.', 'To fracture the bilge of, or stave in the bottom of (a\n   ship or other vessel).'),
(7597, 'Bilge', 'v. t.', 'To cause to bulge.'),
(7598, 'Bilgy', 'a.', 'Having the smell of bilge water.'),
(7599, 'Biliary', 'a.', 'Relating or belonging to bile; conveying bile; as, biliary\n   acids; biliary ducts.'),
(7600, 'Bilimbi', 'n.', 'Alt. of Bilimbing'),
(7601, 'Biliment', 'n.', 'A woman\'s ornament; habiliment.'),
(7602, 'Bilin', 'n.', 'A name applied to the amorphous or crystalline mass obtained\n   from bile by the action of alcohol and ether. It is composed of a\n   mixture of the sodium salts of the bile acids.'),
(7603, 'Bilinear', 'a.', 'Of, pertaining to, or included by, two lines; as,\n   bilinear coordinates.'),
(7604, 'Bilious', 'a.', 'Of or pertaining to the bile.'),
(7605, 'Bilious', 'a.', 'Disordered in respect to the bile; troubled with an excess\n   of bile; as, a bilious patient; dependent on, or characterized by, an\n   excess of bile; as, bilious symptoms.'),
(7606, 'Bilious', 'a.', 'Choleric; passionate; ill tempered.'),
(7607, 'Bilked', 'imp. & p. p.', 'of Bilk'),
(7608, 'Bilking', 'p. pr. & vb. n.', 'of Bilk'),
(7609, 'Billed', 'imp. & p. p.', 'of Bill'),
(7610, 'Billing', 'p. pr. & vb. n.', 'of Bill'),
(7611, 'Billage', 'n. / v. t. & i.', 'Same as Bilge.'),
(7612, 'Billard', 'n.', 'An English fish, allied to the cod; the coalfish.'),
(7613, 'Billbug', 'n.', 'A weevil or curculio of various species, as the corn\n   weevil. See Curculio.'),
(7614, 'Billed', 'a.', 'Furnished with, or having, a bill, as a bird; -- used in\n   composition; as, broad-billed.'),
(7615, 'Billet', 'n.', 'A small paper; a note; a short letter.'),
(7616, 'Billet', 'n.', 'A ticket from a public officer directing soldiers at what\n   house to lodge; as, a billet of residence.'),
(7617, 'Billeted', 'imp. & p. p.', 'of Billet'),
(7618, 'Billet', 'v. t.', 'To direct, by a ticket or note, where to lodge. Hence:\n   To quarter, or place in lodgings, as soldiers in private houses.'),
(7619, 'Billet', 'n.', 'A small stick of wood, as for firewood.'),
(7620, 'Billet', 'n.', 'A short bar of metal, as of gold or iron.'),
(7621, 'Billet', 'n.', 'An ornament in Norman work, resembling a billet of wood\n   either square or round.'),
(7622, 'Billet', 'n.', 'A strap which enters a buckle.'),
(7623, 'Billet', 'n.', 'A loop which receives the end of a buckled strap.'),
(7624, 'Billet', 'n.', 'A bearing in the form of an oblong rectangle.'),
(7625, 'Billfish', 'n.', 'A name applied to several distinct fishes'),
(7626, 'Billfish', 'n.', 'The garfish (Tylosurus, / Belone, longirostris) and\n   allied species.'),
(7627, 'Billfish', 'n.', 'The saury, a slender fish of the Atlantic coast\n   (Scomberesox saurus).'),
(7628, 'Billfish', 'n.', 'The Tetrapturus albidus, a large oceanic species related\n   to the swordfish; the spearfish.'),
(7629, 'Billfish', 'n.', 'The American fresh-water garpike (Lepidosteus osseus).'),
(7630, 'Billhead', 'n.', 'A printed form, used by merchants in making out bills or\n   rendering accounts.'),
(7631, 'Billhook', 'n.', 'A thick, heavy knife with a hooked point, used in pruning\n   hedges, etc. When it has a short handle, it is sometimes called a hand\n   bill; when the handle is long, a hedge bill or scimiter.'),
(7632, 'Billiard', 'a.', 'Of or pertaining to the game of billiards.'),
(7633, 'Billing', 'a. & n.', 'Caressing; kissing.'),
(7634, 'Billion', 'n.', 'According to the French and American method of numeration,\n   a thousand millions, or 1,000,000,000; according to the English method,\n   a million millions, or 1,000,000,000,000. See Numeration.'),
(7635, 'Billmen', 'pl. ', 'of Billman'),
(7636, 'Billman', 'n.', 'One who uses, or is armed with, a bill or hooked ax.'),
(7637, 'Billon', 'n.', 'An alloy of gold and silver with a large proportion of\n   copper or other base metal, used in coinage.'),
(7638, 'Billot', 'n.', 'Bullion in the bar or mass.'),
(7639, 'Billow', 'n.', 'A great wave or surge of the sea or other water, caused\n   usually by violent wind.'),
(7640, 'Billow', 'n.', 'A great wave or flood of anything.'),
(7641, 'Billowed', 'imp. & p. p.', 'of Billow'),
(7642, 'Billow', 'v. i.', 'To surge; to rise and roll in waves or surges; to\n   undulate.'),
(7643, 'Billowy', 'a.', 'Of or pertaining to billows; swelling or swollen into\n   large waves; full of billows or surges; resembling billows.'),
(7644, 'Billy', 'n.', 'A club; esp., a policeman\'s club.'),
(7645, 'Billy', 'n.', 'A slubbing or roving machine.'),
(7646, 'Billyboy', 'n.', 'A flat-bottomed river barge or coasting vessel.'),
(7647, 'Bilobate', 'a.', 'Divided into two lobes or segments.'),
(7648, 'Bilobed', 'a.', 'Bilobate.'),
(7649, 'Bilsted', 'n.', 'See Sweet gum.'),
(7650, 'Biltong', 'n.', 'Lean meat cut into strips and sun-dried.'),
(7651, 'Bimana', 'n. pl.', 'Animals having two hands; -- a term applied by Cuvier\n   to man as a special order of Mammalia.'),
(7652, 'Bimanous', 'a.', 'Having two hands; two-handed.'),
(7653, 'Bimedial', 'a.', 'Applied to a line which is the sum of two lines\n   commensurable only in power (as the side and diagonal of a square).'),
(7654, 'Bimensal', 'a.', 'See Bimonthly, a.'),
(7655, 'Binned', 'imp. & p. p.', 'of Bin'),
(7656, 'Binning', 'p. pr. & vb. n.', 'of Bin'),
(7657, 'Binal', 'a.', 'Twofold; double.'),
(7658, 'Binary', 'a.', 'Compounded or consisting of two things or parts;\n   characterized by two (things).'),
(7659, 'Binary', 'n.', 'That which is constituted of two figures, things, or parts;\n   two; duality.'),
(7660, 'Binate', 'a.', 'Double; growing in pairs or couples.'),
(7661, 'Binaural', 'a.', 'Of or pertaining to, or used by, both ears.'),
(7662, 'Bound', 'imp.', 'of Bind'),
(7663, 'Bound', 'p. p.', 'of Bind'),
(7664, 'Bounden', '', 'of Bind'),
(7665, 'Binding', 'p. pr. & vb. n.', 'of Bind'),
(7666, 'Binder', 'n.', 'One who binds; as, a binder of sheaves; one whose trade is\n   to bind; as, a binder of books.'),
(7667, 'Binder', 'n.', 'Anything that binds, as a fillet, cord, rope, or band; a\n   bandage; -- esp. the principal piece of timber intended to bind\n   together any building.'),
(7668, 'Bindery', 'n.', 'A place where books, or other articles, are bound; a\n   bookbinder\'s establishment.'),
(7669, 'Binding', 'a.', 'That binds; obligatory.'),
(7670, 'Binding', 'n.', 'The act or process of one who, or that which, binds.'),
(7671, 'Binding', 'n.', 'Anything that binds; a bandage; the cover of a book, or\n   the cover with the sewing, etc.; something that secures the edge of\n   cloth from raveling.'),
(7672, 'Binding', 'pl.', 'The transoms, knees, beams, keelson, and other chief\n   timbers used for connecting and strengthening the parts of a vessel.'),
(7673, 'Bindweed', 'n.', 'A plant of the genus Convolvulus; as, greater bindweed\n   (C. Sepium); lesser bindweed (C. arvensis); the white, the blue, the\n   Syrian, bindweed. The black bryony, or Tamus, is called black bindweed,\n   and the Smilax aspera, rough bindweed.'),
(7674, 'Binnacle', 'n.', 'A case or box placed near the helmsman, containing the\n   compass of a ship, and a light to show it at night.'),
(7675, 'Binny', 'n.', 'A large species of barbel (Barbus bynni), found in the Nile,\n   and much esteemed for food.'),
(7676, 'Binocle', 'n.', 'A dioptric telescope, fitted with two tubes joining, so as\n   to enable a person to view an object with both eyes at once; a\n   double-barreled field glass or an opera glass.'),
(7677, 'Binomial', 'n.', 'An expression consisting of two terms connected by the\n   sign plus (+) or minus (-); as, a + b, or 7 - 3.'),
(7678, 'Binomial', 'a.', 'Consisting of two terms; pertaining to binomials; as, a\n   binomial root.'),
(7679, 'Binomial', 'a.', 'Having two names; -- used of the system by which every\n   animal and plant receives two names, the one indicating the genus, the\n   other the species, to which it belongs.'),
(7680, 'Binous', 'a.', 'Same as Binate.'),
(7681, 'Binoxide', 'n.', 'Same as Dioxide.'),
(7682, 'Bioblast', 'n.', 'Same as Bioplast.'),
(7683, 'Biogen', 'n.', 'Bioplasm.'),
(7684, 'Biogeny', 'n.', 'A doctrine that the genesis or production of living\n   organisms can take place only through the agency of living germs or\n   parents; -- opposed to abiogenesis.'),
(7685, 'Biogeny', 'n.', 'Life development generally.'),
(7686, 'Biologic', 'a.', 'Alt. of Biological'),
(7687, 'Biology', 'n.', 'The science of life; that branch of knowledge which treats\n   of living matter as distinct from matter which is not living; the study\n   of living tissue. It has to do with the origin, structure, development,\n   function, and distribution of animals and plants.'),
(7688, 'Biolysis', 'n.', 'The destruction of life.'),
(7689, 'Biolytic', 'a.', 'Relating to the destruction of life.'),
(7690, 'Biometry', 'n.', 'Measurement of life; calculation of the probable duration\n   of human life.'),
(7691, 'Bionomy', 'n.', 'Physiology.'),
(7692, 'Bioplasm', 'n.', 'A name suggested by Dr. Beale for the germinal matter\n   supposed to be essential to the functions of all living beings; the\n   material through which every form of life manifests itself; unaltered\n   protoplasm.'),
(7693, 'Bioplast', 'n.', 'A tiny mass of bioplasm, in itself a living unit and\n   having formative power, as a living white blood corpuscle; bioblast.'),
(7694, 'Biorgan', 'n.', 'A physiological organ; a living organ; an organ endowed\n   with function; -- distinguished from idorgan.'),
(7695, 'Biotaxy', 'n.', 'The classification of living organisms according to their\n   structural character; taxonomy.'),
(7696, 'Biotic', 'a.', 'Relating to life; as, the biotic principle.'),
(7697, 'Biotite', 'n.', 'Mica containing iron and magnesia, generally of a black or\n   dark green color; -- a common constituent of crystalline rocks. See\n   Mica.'),
(7698, 'Biparous', 'a.', 'Bringing forth two at a birth.'),
(7699, 'Biped', 'n.', 'A two-footed animal, as man.'),
(7700, 'Biped', 'a.', 'Having two feet; two-footed.'),
(7701, 'Bipedal', 'n.', 'Having two feet; biped.'),
(7702, 'Bipedal', 'n.', 'Pertaining to a biped.'),
(7703, 'Bipennis', 'n.', 'An ax with an edge or blade on each side of the handle.'),
(7704, 'Bipolar', 'a.', 'Doubly polar; having two poles; as, a bipolar cell or\n   corpuscle.'),
(7705, 'Bipont', 'a.', 'Alt. of Bipontine'),
(7706, 'Biramous', 'a.', 'Having, or consisting of, two branches.'),
(7707, 'Birches', 'pl. ', 'of Birch'),
(7708, 'Birch', 'n.', 'A tree of several species, constituting the genus Betula;\n   as, the white or common birch (B. alba) (also called silver birch and\n   lady birch); the dwarf birch (B. glandulosa); the paper or canoe birch\n   (B. papyracea); the yellow birch (B. lutea); the black or cherry birch\n   (B. lenta).'),
(7709, 'Birch', 'n.', 'The wood or timber of the birch.'),
(7710, 'Birch', 'n.', 'A birch twig or birch twigs, used for flogging.'),
(7711, 'Birch', 'n.', 'A birch-bark canoe.'),
(7712, 'Birch', 'a.', 'Of or pertaining to the birch; birchen.'),
(7713, 'Birched', 'imp. & p. p.', 'of Birch'),
(7714, 'Birching', 'p. pr. & vb. n.', 'of Birch'),
(7715, 'Birch', 'v. t.', 'To whip with a birch rod or twig; to flog.'),
(7716, 'Birchen', 'a.', 'Of or relating to birch.'),
(7717, 'Birdbolt', 'n.', 'A short blunt arrow for killing birds without piercing\n   them.'),
(7718, 'Birdbolt', 'n.', 'Anything which smites without penetrating.'),
(7719, 'Birdcage', 'n.', 'A cage for confining birds.'),
(7720, 'Birdcall', 'n.', 'A sound made in imitation of the note or cry of a bird\n   for the purpose of decoying the bird or its mate.'),
(7721, 'Birdcall', 'n.', 'An instrument of any kind, as a whistle, used in making\n   the sound of a birdcall.'),
(7722, 'Birder', 'n.', 'A birdcatcher.'),
(7723, 'Birdie', 'n.', 'A pretty or dear little bird; -- a pet name.'),
(7724, 'Birdikin', 'n.', 'A young bird.'),
(7725, 'Birding', 'n.', 'Birdcatching or fowling.'),
(7726, 'Birdlet', 'n.', 'A little bird; a nestling.'),
(7727, 'Birdlike', 'a.', 'Resembling a bird.'),
(7728, 'Birdlime', 'n.', 'An extremely adhesive viscid substance, usually made of\n   the middle bark of the holly, by boiling, fermenting, and cleansing it.\n   When a twig is smeared with this substance it will hold small birds\n   which may light upon it. Hence: Anything which insnares.'),
(7729, 'Birdlime', 'v. t.', 'To smear with birdlime; to catch with birdlime; to\n   insnare.'),
(7730, 'Birdling', 'n.', 'A little bird; a nestling.'),
(7731, 'Birdman', 'n.', 'A fowler or birdcatcher.'),
(7732, 'Birdseed', 'n.', 'Canary seed, hemp, millet or other small seeds used for\n   feeding caged birds.'),
(7733, 'Bireme', 'n.', 'An ancient galley or vessel with two banks or tiers of\n   oars.'),
(7734, 'Biretta', 'n.', 'Same as Berretta.'),
(7735, 'Birken', 'v. t.', 'To whip with a birch or rod.'),
(7736, 'Birken', 'a.', 'Birchen; as, birken groves.'),
(7737, 'Birkie', 'n.', 'A lively or mettlesome fellow.'),
(7738, 'Birlaw', 'n.', 'A law made by husbandmen respecting rural affairs; a rustic\n   or local law or by-law.'),
(7739, 'Birred', 'imp. & p. p.', 'of Birr'),
(7740, 'Birring', 'p. pr. & vb. n.', 'of Birr'),
(7741, 'Birrus', 'n.', 'A coarse kind of thick woolen cloth, worn by the poor in\n   the Middle Ages; also, a woolen cap or hood worn over the shoulders or\n   over the head.'),
(7742, 'Birse', 'n.', 'A bristle or bristles.'),
(7743, 'Birth', 'n.', 'The act or fact of coming into life, or of being born; --\n   generally applied to human beings; as, the birth of a son.'),
(7744, 'Birth', 'n.', 'Lineage; extraction; descent; sometimes, high birth; noble\n   extraction.'),
(7745, 'Birth', 'n.', 'The condition to which a person is born; natural state or\n   position; inherited disposition or tendency.'),
(7746, 'Birth', 'n.', 'The act of bringing forth; as, she had two children at a\n   birth.'),
(7747, 'Birth', 'n.', 'That which is born; that which is produced, whether animal\n   or vegetable.'),
(7748, 'Birth', 'n.', 'Origin; beginning; as, the birth of an empire.'),
(7749, 'Birth', 'n.', 'See Berth.'),
(7750, 'Birthday', 'n.', 'The day in which any person is born; day of origin or\n   commencement.'),
(7751, 'Birthday', 'n.', 'The day of the month in which a person was born, in\n   whatever succeeding year it may recur; the anniversary of one\'s birth.'),
(7752, 'Birthday', 'a.', 'Of or pertaining to the day of birth, or its anniversary;\n   as, birthday gifts or festivities.'),
(7753, 'Birthdom', 'n.', 'The land of one\'s birth; one\'s inheritance.'),
(7754, 'Birthing', 'n.', 'Anything added to raise the sides of a ship.'),
(7755, 'Biscayan', 'a.', 'Of or pertaining to Biscay in Spain.'),
(7756, 'Biscayan', 'n.', 'A native or inhabitant of Biscay.'),
(7757, 'Biscotin', 'n.', 'A confection made of flour, sugar, marmalade, and eggs; a\n   sweet biscuit.'),
(7758, 'Biscuit', 'n.', 'A kind of unraised bread, of many varieties, plain, sweet,\n   or fancy, formed into flat cakes, and bakes hard; as, ship biscuit.'),
(7759, 'Biscuit', 'n.', 'A small loaf or cake of bread, raised and shortened, or\n   made light with soda or baking powder. Usually a number are baked in\n   the same pan, forming a sheet or card.'),
(7760, 'Biscuit', 'n.', 'Earthen ware or porcelain which has undergone the first\n   baking, before it is subjected to the glazing.'),
(7761, 'Biscuit', 'n.', 'A species of white, unglazed porcelain, in which vases,\n   figures, and groups are formed in miniature.'),
(7762, 'Bisected', 'imp. & p. p.', 'of Bisect'),
(7763, 'Bisect', 'v. t.', 'To cut or divide into two parts.'),
(7764, 'Bisect', 'v. t.', 'To divide into two equal parts.'),
(7765, 'Bisector', 'n.', 'One who, or that which, bisects; esp. (Geom.) a straight\n   line which bisects an angle.'),
(7766, 'Biserial', 'a.', 'Alt. of Biseriate'),
(7767, 'Bisetose', 'a.', 'Alt. of Bisetous'),
(7768, 'Bisetous', 'a.', 'Having two bristles.'),
(7769, 'Bisexous', 'a.', 'Bisexual.'),
(7770, 'Bisexual', 'a.', 'Of both sexes; hermaphrodite; as a flower with stamens\n   and pistil, or an animal having ovaries and testes.'),
(7771, 'Biseye', '', 'p. p. of Besee.'),
(7772, 'Bishop', 'n.', 'A spiritual overseer, superintendent, or director.'),
(7773, 'Bishop', 'n.', 'In the Roman Catholic, Greek, and Anglican or Protestant\n   Episcopal churches, one ordained to the highest order of the ministry,\n   superior to the priesthood, and generally claiming to be a successor of\n   the Apostles. The bishop is usually the spiritual head or ruler of a\n   diocese, bishopric, or see.'),
(7774, 'Bishop', 'n.', 'In the Methodist Episcopal and some other churches, one of\n   the highest church officers or superintendents.'),
(7775, 'Bishop', 'n.', 'A piece used in the game of chess, bearing a representation\n   of a bishop\'s miter; -- formerly called archer.'),
(7776, 'Bishop', 'n.', 'A beverage, being a mixture of wine, oranges or lemons, and\n   sugar.'),
(7777, 'Bishop', 'n.', 'An old name for a woman\'s bustle.'),
(7778, 'Bishoped', 'imp. & p. p.', 'of Bishop'),
(7779, 'Bishop', 'v. t.', 'To admit into the church by confirmation; to confirm;\n   hence, to receive formally to favor.'),
(7780, 'Bishoped', 'imp. & p. p.', 'of Bishop'),
(7781, 'Bishop', 'v. t.', 'To make seem younger, by operating on the teeth; as, to\n   bishop an old horse or his teeth.'),
(7782, 'Bishoply', 'a.', 'Bishoplike; episcopal.'),
(7783, 'Bishoply', 'adv.', 'In the manner of a bishop.'),
(7784, 'Bisie', 'v. t.', 'To busy; to employ.'),
(7785, 'Bismare', 'n.', 'Alt. of Bismer'),
(7786, 'Bismer', 'n.', 'Shame; abuse.'),
(7787, 'Bismer', 'n.', 'A rule steelyard.'),
(7788, 'Bismer', 'n.', 'The fifteen-spined (Gasterosteus spinachia).'),
(7789, 'Bismite', 'n.', 'Bismuth trioxide, or bismuth ocher.'),
(7790, 'Bismuth', 'n.', 'One of the elements; a metal of a reddish white color,\n   crystallizing in rhombohedrons. It is somewhat harder than lead, and\n   rather brittle; masses show broad cleavage surfaces when broken across.\n   It melts at 507¡ Fahr., being easily fused in the flame of a candle. It\n   is found in a native state, and as a constituent of some minerals.\n   Specific gravity 9.8. Atomic weight 207.5. Symbol Bi.'),
(7791, 'Bison', 'n.', 'The aurochs or European bison.'),
(7792, 'Bison', 'n.', 'The American bison buffalo (Bison Americanus), a large,\n   gregarious bovine quadruped with shaggy mane and short black horns,\n   which formerly roamed in herds over most of the temperate portion of\n   North America, but is now restricted to very limited districts in the\n   region of the Rocky Mountains, and is rapidly decreasing in numbers.'),
(7793, 'Bisque', 'n.', 'Unglazed white porcelain.'),
(7794, 'Bisque', 'n.', 'A point taken by the receiver of odds in the game of\n   tennis; also, an extra innings allowed to a weaker player in croquet.'),
(7795, 'Bisque', 'n.', 'A white soup made of crayfish.'),
(7796, 'Bisson', 'a.', 'Purblind; blinding.'),
(7797, 'Bister', 'n.', 'Alt. of Bistre'),
(7798, 'Bistre', 'n.', 'A dark brown pigment extracted from the soot of wood.'),
(7799, 'Bistort', 'n.', 'An herbaceous plant of the genus Polygonum, section\n   Bistorta; snakeweed; adderwort. Its root is used in medicine as an\n   astringent.'),
(7800, 'Bistoury', 'n.', 'A surgical instrument consisting of a slender knife,\n   either straight or curved, generally used by introducing it beneath the\n   part to be divided, and cutting towards the surface.'),
(7801, 'Bistre', 'n.', 'See Bister.'),
(7802, 'Bitted', 'imp. & p. p.', 'of Bit'),
(7803, 'Bitting', 'p. pr. & vb. n.', 'of Bit'),
(7804, 'Bitake', 'v. t.', 'To commend; to commit.'),
(7805, 'Bitch', 'n.', 'The female of the canine kind, as of the dog, wolf, and fox.'),
(7806, 'Bitch', 'n.', 'An opprobrious name for a woman, especially a lewd woman.'),
(7807, 'Bitten', 'p. p.', 'of Bite'),
(7808, 'Biting', 'p. pr. & vb. n.', 'of Bite'),
(7809, 'Biter', 'n.', 'One who, or that which, bites; that which bites often, or is\n   inclined to bite, as a dog or fish.'),
(7810, 'Biter', 'n.', 'One who cheats; a sharper.'),
(7811, 'Bitheism', 'n.', 'Belief in the existence of two gods; dualism.'),
(7812, 'Biting', 'a.', 'That bites; sharp; cutting; sarcastic; caustic.'),
(7813, 'Bitingly', 'adv.', 'In a biting manner.'),
(7814, 'Bitless', 'a.', 'Not having a bit or bridle.'),
(7815, 'Bitstock', 'n.', 'A stock or handle for holding and rotating a bit; a\n   brace.'),
(7816, 'Bittacle', 'n.', 'A binnacle.'),
(7817, 'Bitten', '', 'p. p. of Bite.'),
(7818, 'Bitten', 'a.', 'Terminating abruptly, as if bitten off; premorse.'),
(7819, 'Bitter', 'n.', 'AA turn of the cable which is round the bitts.'),
(7820, 'Bitter', 'v. t.', 'Having a peculiar, acrid, biting taste, like that of\n   wormwood or an infusion of hops; as, a bitter medicine; bitter as\n   aloes.'),
(7821, 'Bitter', 'v. t.', 'Causing pain or smart; piercing; painful; sharp; severe;\n   as, a bitter cold day.'),
(7822, 'Bitter', 'v. t.', 'Causing, or fitted to cause, pain or distress to the\n   mind; calamitous; poignant.'),
(7823, 'Bitter', 'v. t.', 'Characterized by sharpness, severity, or cruelty; harsh;\n   stern; virulent; as, bitter reproach.'),
(7824, 'Bitter', 'v. t.', 'Mournful; sad; distressing; painful; pitiable.'),
(7825, 'Bitter', 'n.', 'Any substance that is bitter. See Bitters.'),
(7826, 'Bitter', 'v. t.', 'To make bitter.'),
(7827, 'Bitterly', 'adv.', 'In a bitter manner.'),
(7828, 'Bittern', 'n.', 'A wading bird of the genus Botaurus, allied to the herons,\n   of various species.'),
(7829, 'Bittern', 'a.', 'The brine which remains in salt works after the salt is\n   concreted, having a bitter taste from the chloride of magnesium which\n   it contains.'),
(7830, 'Bittern', 'a.', 'A very bitter compound of quassia, cocculus Indicus, etc.,\n   used by fraudulent brewers in adulterating beer.'),
(7831, 'Bitters', 'n. pl.', 'A liquor, generally spirituous in which a bitter herb,\n   leaf, or root is steeped.'),
(7832, 'Bittock', 'n.', 'A small bit of anything, of indefinite size or quantity; a\n   short distance.'),
(7833, 'Bitts', 'n. pl.', 'A frame of two strong timbers fixed perpendicularly in\n   the fore part of a ship, on which to fasten the cables as the ship\n   rides at anchor, or in warping. Other bitts are used for belaying\n   (belaying bitts), for sustaining the windlass (carrick bitts, winch\n   bitts, or windlass bitts), to hold the pawls of the windlass (pawl\n   bitts) etc.'),
(7834, 'Bitume', 'n.', 'Bitumen.'),
(7835, 'Bitumed', 'a.', 'Smeared with bitumen.'),
(7836, 'Bitumen', 'n.', 'Mineral pitch; a black, tarry substance, burning with a\n   bright flame; Jew\'s pitch. It occurs as an abundant natural product in\n   many places, as on the shores of the Dead and Caspian Seas. It is used\n   in cements, in the construction of pavements, etc. See Asphalt.'),
(7837, 'Bitumen', 'n.', 'By extension, any one of the natural hydrocarbons,\n   including the hard, solid, brittle varieties called asphalt, the\n   semisolid maltha and mineral tars, the oily petroleums, and even the\n   light, volatile naphthas.'),
(7838, 'Biuret', 'n.', 'A white, crystalline, nitrogenous substance, C2O2N3H5,\n   formed by heating urea. It is intermediate between urea and cyanuric\n   acid.'),
(7839, 'Bivalent', 'p. pr.', 'Equivalent in combining or displacing power to two\n   atoms of hydrogen; dyad.'),
(7840, 'Bivalve', 'n.', 'A mollusk having a shell consisting of two lateral plates\n   or valves joined together by an elastic ligament at the hinge, which is\n   usually strengthened by prominences called teeth. The shell is closed\n   by the contraction of two transverse muscles attached to the inner\n   surface, as in the clam, -- or by one, as in the oyster. See Mollusca.'),
(7841, 'Bivalve', 'n.', 'A pericarp in which the seed case opens or splits into two\n   parts or valves.'),
(7842, 'Bivalve', 'a.', 'Having two shells or valves which open and shut, as the\n   oyster and certain seed vessels.'),
(7843, 'Bivalved', 'a.', 'Having two valves, as the oyster and some seed pods;\n   bivalve.'),
(7844, 'Bivector', 'n.', 'A term made up of the two parts / + /1 /-1, where / and\n   /1 are vectors.'),
(7845, 'Bivial', 'a.', 'Of or relating to the bivium.'),
(7846, 'Bivious', 'a.', 'Having, or leading, two ways.'),
(7847, 'Bivium', 'n.', 'One side of an echinoderm, including a pair of ambulacra,\n   in distinction from the opposite side (trivium), which includes three\n   ambulacra.'),
(7848, 'Bivouac', 'n.', 'The watch of a whole army by night, when in danger of\n   surprise or attack.'),
(7849, 'Bivouac', 'n.', 'An encampment for the night without tents or covering.'),
(7850, 'Bivouac', 'v. i.', 'To watch at night or be on guard, as a whole army.'),
(7851, 'Bivouac', 'v. i.', 'To encamp for the night without tents or covering.'),
(7852, 'Biweekly', 'a.', 'Occurring or appearing once every two weeks; fortnightly.'),
(7853, 'Biweekly', 'n.', 'A publication issued every two weeks.'),
(7854, 'Biwreye', 'v. t.', 'To bewray; to reveal.'),
(7855, 'Bizarre', 'a.', 'Odd in manner or appearance; fantastic; whimsical;\n   extravagant; grotesque.'),
(7856, 'Bizet', 'n.', 'The upper faceted portion of a brilliant-cut diamond, which\n   projects from the setting and occupies the zone between the girdle and\n   the table. See Brilliant, n.'),
(7857, 'Blabbed', 'imp. & p. p.', 'of Blab'),
(7858, 'Blabbing', 'p. pr. & vb. n.', 'of Blab'),
(7859, 'Blabber', 'n.', 'A tattler; a telltale.'),
(7860, 'Black', 'a.', 'Destitute of light, or incapable of reflecting it; of the\n   color of soot or coal; of the darkest or a very dark color, the\n   opposite of white; characterized by such a color; as, black cloth;\n   black hair or eyes.'),
(7861, 'Black', 'a.', 'In a less literal sense: Enveloped or shrouded in darkness;\n   very dark or gloomy; as, a black night; the heavens black with clouds.'),
(7862, 'Black', 'a.', 'Fig.: Dismal, gloomy, or forbidding, like darkness;\n   destitute of moral light or goodness; atrociously wicked; cruel;\n   mournful; calamitous; horrible.'),
(7863, 'Black', 'a.', 'Expressing menace, or discontent; threatening; sullen;\n   foreboding; as, to regard one with black looks.'),
(7864, 'Black', 'adv.', 'Sullenly; threateningly; maliciously; so as to produce\n   blackness.'),
(7865, 'Black', 'n.', 'That which is destitute of light or whiteness; the darkest\n   color, or rather a destitution of all color; as, a cloth has a good\n   black.'),
(7866, 'Black', 'n.', 'A black pigment or dye.'),
(7867, 'Black', 'n.', 'A negro; a person whose skin is of a black color, or shaded\n   with black; esp. a member or descendant of certain African races.'),
(7868, 'Black', 'n.', 'A black garment or dress; as, she wears black'),
(7869, 'Black', 'n.', 'Mourning garments of a black color; funereal drapery.'),
(7870, 'Black', 'n.', 'The part of a thing which is distinguished from the rest by\n   being black.'),
(7871, 'Black', 'n.', 'A stain; a spot; a smooch.'),
(7872, 'Blacked', 'imp. & p. p.', 'of Black'),
(7873, 'Blacking', 'p. pr. & vb. n.', 'of Black'),
(7874, 'Black', 'a.', 'To make black; to blacken; to soil; to sully.'),
(7875, 'Black', 'a.', 'To make black and shining, as boots or a stove, by applying\n   blacking and then polishing with a brush.'),
(7876, 'Blackcap', 'n.', 'A small European song bird (Sylvia atricapilla), with a\n   black crown; the mock nightingale.'),
(7877, 'Blackcap', 'n.', 'An American titmouse (Parus atricapillus); the chickadee.'),
(7878, 'Blackcap', 'n.', 'An apple roasted till black, to be served in a dish of\n   boiled custard.'),
(7879, 'Blackcap', 'n.', 'The black raspberry.'),
(7880, 'Blacken', 'v. t.', 'To make or render black.'),
(7881, 'Blacken', 'v. t.', 'To make dark; to darken; to cloud.'),
(7882, 'Blacken', 'v. t.', 'To defame; to sully, as reputation; to make infamous;\n   as, vice blackens the character.'),
(7883, 'Blacken', 'v. i.', 'To grow black or dark.'),
(7884, 'Blackfin', 'n.', 'See Bluefin.'),
(7885, 'Blacking', 'n.', 'Any preparation for making things black; esp. one for\n   giving a black luster to boots and shoes, or to stoves.'),
(7886, 'Blacking', 'n.', 'The act or process of making black.'),
(7887, 'Blackish', 'a.', 'Somewhat black.'),
(7888, 'Blackleg', 'n.', 'A notorious gambler.'),
(7889, 'Blackleg', 'n.', 'A disease among calves and sheep, characterized by a\n   settling of gelatinous matter in the legs, and sometimes in the neck.'),
(7890, 'Blackly', 'adv.', 'In a black manner; darkly, in color; gloomily;\n   threateningly; atrociously.'),
(7891, 'Blacks', 'n. pl.', 'The name of a kind of in used in copperplate printing,\n   prepared from the charred husks of the grape, and residue of the wine\n   press.'),
(7892, 'Blacks', 'n. pl.', 'Soot flying in the air.'),
(7893, 'Blacks', 'n. pl.', 'Black garments, etc. See Black, n., 4.'),
(7894, 'Bladder', 'n.', 'A bag or sac in animals, which serves as the receptacle of\n   some fluid; as, the urinary bladder; the gall bladder; -- applied\n   especially to the urinary bladder, either within the animal, or when\n   taken out and inflated with air.'),
(7895, 'Bladder', 'n.', 'Any vesicle or blister, especially if filled with air, or\n   a thin, watery fluid.'),
(7896, 'Bladder', 'n.', 'A distended, membranaceous pericarp.'),
(7897, 'Bladder', 'n.', 'Anything inflated, empty, or unsound.'),
(7898, 'Bladder', 'v. t.', 'To swell out like a bladder with air; to inflate.'),
(7899, 'Bladder', 'v. t.', 'To put up in bladders; as, bladdered lard.'),
(7900, 'Bladdery', 'a.', 'Having bladders; also, resembling a bladder.'),
(7901, 'Blade', 'n.', 'Properly, the leaf, or flat part of the leaf, of any plant,\n   especially of gramineous plants. The term is sometimes applied to the\n   spire of grasses.'),
(7902, 'Blade', 'n.', 'The cutting part of an instrument; as, the blade of a knife\n   or a sword.'),
(7903, 'Blade', 'n.', 'The broad part of an oar; also, one of the projecting arms\n   of a screw propeller.'),
(7904, 'Blade', 'n.', 'The scapula or shoulder blade.'),
(7905, 'Blade', 'n.', 'The principal rafters of a roof.'),
(7906, 'Blade', 'n.', 'The four large shell plates on the sides, and the five large\n   ones of the middle, of the carapace of the sea turtle, which yield the\n   best tortoise shell.'),
(7907, 'Blade', 'n.', 'A sharp-witted, dashing, wild, or reckless, fellow; -- a\n   word of somewhat indefinite meaning.'),
(7908, 'Blade', 'v. t.', 'To furnish with a blade.'),
(7909, 'Blade', 'v. i.', 'To put forth or have a blade.'),
(7910, 'Bladed', 'a.', 'Having a blade or blades; as, a two-bladed knife.'),
(7911, 'Bladed', 'a.', 'Divested of blades; as, bladed corn.'),
(7912, 'Bladed', 'a.', 'Composed of long and narrow plates, shaped like the blade\n   of a knife.'),
(7913, 'Blady', 'a.', 'Consisting of blades.'),
(7914, 'Blague', 'n.', 'Mendacious boasting; falsehood; humbug.'),
(7915, 'Blain', 'n.', 'An inflammatory swelling or sore; a bulla, pustule, or\n   blister.'),
(7916, 'Blain', 'n.', 'A bladder growing on the root of the tongue of a horse,\n   against the windpipe, and stopping the breath.'),
(7917, 'Blamable', 'a.', 'Deserving of censure; faulty; culpable; reprehensible;\n   censurable; blameworthy.'),
(7918, 'Blamed', 'imp. & p. p.', 'of Blame'),
(7919, 'Blaming', 'p. pr. & vb. n.', 'of Blame'),
(7920, 'Blame', 'v. t.', 'To censure; to express disapprobation of; to find fault\n   with; to reproach.'),
(7921, 'Blame', 'v. t.', 'To bring reproach upon; to blemish.'),
(7922, 'Blame', 'v.', 'An expression of disapprobation fir something deemed to be\n   wrong; imputation of fault; censure.'),
(7923, 'Blame', 'v.', 'That which is deserving of censure or disapprobation;\n   culpability; fault; crime; sin.'),
(7924, 'Blame', 'v.', 'Hurt; injury.'),
(7925, 'Blameful', 'a.', 'Faulty; meriting blame.'),
(7926, 'Blameful', 'a.', 'Attributing blame or fault; implying or conveying\n   censure; faultfinding; censorious.'),
(7927, 'Blamer', 'n.', 'One who blames.'),
(7928, 'Blancard', 'n.', 'A kind of linen cloth made in Normandy, the thread of\n   which is partly blanches before it is woven.'),
(7929, 'Blanched', 'imp. & p. p.', 'of Blanch'),
(7930, 'Blanch', 'a.', 'To take the color out of, and make white; to bleach; as, to\n   blanch linen; age has blanched his hair.'),
(7931, 'Blanch', 'a.', 'To bleach by excluding the light, as the stalks or leaves\n   of plants, by earthing them up or tying them together.'),
(7932, 'Blanch', 'a.', 'To make white by removing the skin of, as by scalding; as,\n   to blanch almonds.'),
(7933, 'Blanch', 'a.', 'To whiten, as the surface of meat, by plunging into boiling\n   water and afterwards into cold, so as to harden the surface and retain\n   the juices.'),
(7934, 'Blanch', 'a.', 'To give a white luster to (silver, before stamping, in the\n   process of coining.).'),
(7935, 'Blanch', 'a.', 'To cover (sheet iron) with a coating of tin.'),
(7936, 'Blanch', 'a.', 'Fig.: To whiten; to give a favorable appearance to; to\n   whitewash; to palliate.'),
(7937, 'Blanch', 'v. i.', 'To grow or become white; as, his cheek blanched with\n   fear; the rose blanches in the sun.'),
(7938, 'Blanch', 'v. t.', 'To avoid, as from fear; to evade; to leave unnoticed.'),
(7939, 'Blanch', 'v. t.', 'To cause to turn aside or back; as, to blanch a deer.'),
(7940, 'Blanch', 'v. i.', 'To use evasion.'),
(7941, 'Blanch', 'n.', 'Ore, not in masses, but mixed with other minerals.'),
(7942, 'Blancher', 'n.', 'One who, or that which, blanches or whitens; esp., one\n   who anneals and cleanses money; also, a chemical preparation for this\n   purpose.'),
(7943, 'Blancher', 'n.', 'One who, or that which, frightens away or turns aside.'),
(7944, 'Bland', 'a.', 'Mild; soft; gentle; smooth and soothing in manner; suave;\n   as, a bland temper; bland persuasion; a bland sycophant.'),
(7945, 'Bland', 'a.', 'Having soft and soothing qualities; not drastic or\n   irritating; not stimulating; as, a bland oil; a bland diet.'),
(7946, 'Blandise', 'v. i.', 'To blandish any one.'),
(7947, 'Blandish', 'v. t.', 'To flatter with kind words or affectionate actions; to\n   caress; to cajole.'),
(7948, 'Blandish', 'v. t.', 'To make agreeable and enticing.'),
(7949, 'Blandly', 'adv.', 'In a bland manner; mildly; suavely.'),
(7950, 'Blank', 'a.', 'Of a white or pale color; without color.'),
(7951, 'Blank', 'a.', 'Free from writing, printing, or marks; having an empty space\n   to be filled in with some special writing; -- said of checks, official\n   documents, etc.; as, blank paper; a blank check; a blank ballot.'),
(7952, 'Blank', 'a.', 'Utterly confounded or discomfited.'),
(7953, 'Blank', 'a.', 'Empty; void; without result; fruitless; as, a blank space; a\n   blank day.'),
(7954, 'Blank', 'a.', 'Lacking characteristics which give variety; as, a blank\n   desert; a blank wall; destitute of interests, affections, hopes, etc.;\n   as, to live a blank existence; destitute of sensations; as, blank\n   unconsciousness.'),
(7955, 'Blank', 'a.', 'Lacking animation and intelligence, or their associated\n   characteristics, as expression of face, look, etc.; expressionless;\n   vacant.'),
(7956, 'Blank', 'a.', 'Absolute; downright; unmixed; as, blank terror.'),
(7957, 'Blank', 'n.', 'Any void space; a void space on paper, or in any written\n   instrument; an interval void of consciousness, action, result, etc; a\n   void.'),
(7958, 'Blank', 'n.', 'A lot by which nothing is gained; a ticket in a lottery on\n   which no prize is indicated.'),
(7959, 'Blank', 'n.', 'A paper unwritten; a paper without marks or characters a\n   blank ballot; -- especially, a paper on which are to be inserted\n   designated items of information, for which spaces are left vacant; a\n   bland form.'),
(7960, 'Blank', 'n.', 'A paper containing the substance of a legal instrument, as a\n   deed, release, writ, or execution, with spaces left to be filled with\n   names, date, descriptions, etc.'),
(7961, 'Blank', 'n.', 'The point aimed at in a target, marked with a white spot;\n   hence, the object to which anything is directed.'),
(7962, 'Blank', 'n.', 'Aim; shot; range.'),
(7963, 'Blank', 'n.', 'A kind of base silver money, first coined in England by\n   Henry V., and worth about 8 pence; also, a French coin of the\n   seventeenth century, worth about 4 pence.'),
(7964, 'Blank', 'n.', 'A piece of metal prepared to be made into something by a\n   further operation, as a coin, screw, nuts.'),
(7965, 'Blank', 'n.', 'A piece or division of a piece, without spots; as, the\n   \"double blank\"; the \"six blank.\"'),
(7966, 'Blanked', 'imp. & p. p.', 'of Blank'),
(7967, 'Blanking', 'p. pr. & vb. n.', 'of Blank'),
(7968, 'Blank', 'v. t.', 'To make void; to annul.'),
(7969, 'Blank', 'v. t.', 'To blanch; to make blank; to damp the spirits of; to\n   dispirit or confuse.'),
(7970, 'Blanket', 'a.', 'A heavy, loosely woven fabric, usually of wool, and having\n   a nap, used in bed clothing; also, a similar fabric used as a robe; or\n   any fabric used as a cover for a horse.'),
(7971, 'Blanket', 'a.', 'A piece of rubber, felt, or woolen cloth, used in the\n   tympan to make it soft and elastic.'),
(7972, 'Blanket', 'a.', 'A streak or layer of blubber in whales.'),
(7973, 'Blanket', 'v. t.', 'To cover with a blanket.'),
(7974, 'Blanket', 'v. t.', 'To toss in a blanket by way of punishment.'),
(7975, 'Blanket', 'v. t.', 'To take the wind out of the sails of (another vessel)\n   by sailing to windward of her.'),
(7976, 'Blankly', 'adv.', 'In a blank manner; without expression; vacuously; as, to\n   stare blankly.'),
(7977, 'Blankly', 'adv.', 'Directly; flatly; point blank.'),
(7978, 'Blared', 'imp. & p. p.', 'of Blare'),
(7979, 'Blaring', 'p. pr. & vb. n.', 'of Blare'),
(7980, 'Blare', 'v. i.', 'To sound loudly and somewhat harshly.'),
(7981, 'Blare', 'v. t.', 'To cause to sound like the blare of a trumpet; to\n   proclaim loudly.'),
(7982, 'Blare', 'n.', 'The harsh noise of a trumpet; a loud and somewhat harsh\n   noise, like the blast of a trumpet; a roar or bellowing.'),
(7983, 'Blarney', 'n.', 'Smooth, wheedling talk; flattery.'),
(7984, 'Blarney', 'v. t.', 'To influence by blarney; to wheedle with smooth talk;\n   to make or accomplish by blarney.'),
(7985, 'Blase', 'a.', 'Having the sensibilities deadened by excess or frequency of\n   enjoyment; sated or surfeited with pleasure; used up.'),
(7986, '-blast', '', 'A suffix or terminal formative, used principally in\n   biological terms, and signifying growth, formation; as, bioblast,\n   epiblast, mesoblast, etc.'),
(7987, 'Blast', 'n.', 'A violent gust of wind.'),
(7988, 'Blast', 'n.', 'A forcible stream of air from an orifice, as from a bellows,\n   the mouth, etc. Hence: The continuous blowing to which one charge of\n   ore or metal is subjected in a furnace; as, to melt so many tons of\n   iron at a blast.'),
(7989, 'Blast', 'n.', 'The exhaust steam from and engine, driving a column of air\n   out of a boiler chimney, and thus creating an intense draught through\n   the fire; also, any draught produced by the blast.'),
(7990, 'Blast', 'n.', 'The sound made by blowing a wind instrument; strictly, the\n   sound produces at one breath.'),
(7991, 'Blast', 'n.', 'A sudden, pernicious effect, as if by a noxious wind,\n   especially on animals and plants; a blight.'),
(7992, 'Blast', 'n.', 'The act of rending, or attempting to rend, heavy masses of\n   rock, earth, etc., by the explosion of gunpowder, dynamite, etc.; also,\n   the charge used for this purpose.'),
(7993, 'Blast', 'n.', 'A flatulent disease of sheep.'),
(7994, 'Blasted', 'imp. & p. p.', 'of Blast'),
(7995, 'Blasting', 'p. pr. & vb. n.', 'of Blast'),
(7996, 'Blast', 'v. t.', 'To injure, as by a noxious wind; to cause to wither; to\n   stop or check the growth of, and prevent from fruit-bearing, by some\n   pernicious influence; to blight; to shrivel.'),
(7997, 'Blast', 'v. t.', 'Hence, to affect with some sudden violence, plague,\n   calamity, or blighting influence, which destroys or causes to fail; to\n   visit with a curse; to curse; to ruin; as, to blast pride, hopes, or\n   character.'),
(7998, 'Blast', 'v. t.', 'To confound by a loud blast or din.'),
(7999, 'Blast', 'v. t.', 'To rend open by any explosive agent, as gunpowder,\n   dynamite, etc.; to shatter; as, to blast rocks.'),
(8000, 'Blast', 'v. i.', 'To be blighted or withered; as, the bud blasted in the\n   blossom.'),
(8001, 'Blast', 'v. i.', 'To blow; to blow on a trumpet.'),
(8002, 'Blasted', 'a.', 'Blighted; withered.'),
(8003, 'Blasted', 'a.', 'Confounded; accursed; detestable.'),
(8004, 'Blasted', 'a.', 'Rent open by an explosive.'),
(8005, 'Blastema', 'n.', 'The structureless, protoplasmic tissue of the embryo; the\n   primitive basis of an organ yet unformed, from which it grows.'),
(8006, 'Blaster', 'n.', 'One who, or that which, blasts or destroys.'),
(8007, 'Blastide', 'n.', 'A small, clear space in the segments of the ovum, the\n   precursor of the nucleus.'),
(8008, 'Blasting', 'n.', 'A blast; destruction by a blast, or by some pernicious\n   cause.'),
(8009, 'Blasting', 'n.', 'The act or process of one who, or that which, blasts; the\n   business of one who blasts.'),
(8010, 'Blastoid', 'n.', 'One of the Blastoidea.'),
(8011, 'Blastula', 'n.', 'That stage in the development of the ovum in which the\n   outer cells of the morula become more defined and form the blastoderm.'),
(8012, 'Blastule', 'n.', 'Same as Blastula.'),
(8013, 'Blasty', 'a.', 'Affected by blasts; gusty.'),
(8014, 'Blasty', 'a.', 'Causing blast or injury.'),
(8015, 'Blatancy', 'n.', 'Blatant quality.'),
(8016, 'Blatant', 'a.', 'Bellowing, as a calf; bawling; brawling; clamoring;\n   disagreeably clamorous; sounding loudly and harshly.'),
(8017, 'Blatter', 'v. i.', 'To prate; to babble; to rail; to make a senseless\n   noise; to patter.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(8018, 'Blaubok', 'n.', 'The blue buck. See Blue buck, under Blue.'),
(8019, 'Blaze', 'n.', 'A stream of gas or vapor emitting light and heat in the\n   process of combustion; a bright flame.'),
(8020, 'Blaze', 'n.', 'Intense, direct light accompanied with heat; as, to seek\n   shelter from the blaze of the sun.'),
(8021, 'Blaze', 'n.', 'A bursting out, or active display of any quality; an\n   outburst; a brilliant display.'),
(8022, 'Blaze', 'n.', 'A white spot on the forehead of a horse.'),
(8023, 'Blaze', 'n.', 'A spot made on trees by chipping off a piece of the bark,\n   usually as a surveyor\'s mark.'),
(8024, 'Blazed', 'imp. & p. p.', 'of Blaze'),
(8025, 'Blazing', 'p. pr. & vb. n.', 'of Blaze'),
(8026, 'Blaze', 'v. i.', 'To shine with flame; to glow with flame; as, the fire\n   blazes.'),
(8027, 'Blaze', 'v. i.', 'To send forth or reflect glowing or brilliant light; to\n   show a blaze.'),
(8028, 'Blaze', 'v. i.', 'To be resplendent.'),
(8029, 'Blaze', 'v. t.', 'To mark (a tree) by chipping off a piece of the bark.'),
(8030, 'Blaze', 'v. t.', 'To designate by blazing; to mark out, as by blazed trees;\n   as, to blaze a line or path.'),
(8031, 'Blaze', 'v. i.', 'To make public far and wide; to make known; to render\n   conspicuous.'),
(8032, 'Blaze', 'v. i.', 'To blazon.'),
(8033, 'Blazer', 'n.', 'One who spreads reports or blazes matters abroad.'),
(8034, 'Blazing', 'a.', 'Burning with a blaze; as, a blazing fire; blazing torches.'),
(8035, 'Blazon', 'n.', 'A shield.'),
(8036, 'Blazon', 'n.', 'An heraldic shield; a coat of arms, or a bearing on a coat\n   of arms; armorial bearings.'),
(8037, 'Blazon', 'n.', 'The art or act of describing or depicting heraldic bearings\n   in the proper language or manner.'),
(8038, 'Blazon', 'n.', 'Ostentatious display, either by words or other means;\n   publication; show; description; record.'),
(8039, 'Blazoned', 'imp. & p. p.', 'of Blazon'),
(8040, 'Blazon', 'v. t.', 'To depict in colors; to display; to exhibit\n   conspicuously; to publish or make public far and wide.'),
(8041, 'Blazon', 'v. t.', 'To deck; to embellish; to adorn.'),
(8042, 'Blazon', 'v. t.', 'To describe in proper terms (the figures of heraldic\n   devices); also, to delineate (armorial bearings); to emblazon.'),
(8043, 'Blazon', 'v. i.', 'To shine; to be conspicuous.'),
(8044, 'Blazoner', 'n.', 'One who gives publicity, proclaims, or blazons; esp., one\n   who blazons coats of arms; a herald.'),
(8045, 'Blazonry', 'n.', 'Same as Blazon, 3.'),
(8046, 'Blazonry', 'n.', 'A coat of arms; an armorial bearing or bearings.'),
(8047, 'Blazonry', 'n.', 'Artistic representation or display.'),
(8048, 'Bleached', 'imp. & p. p.', 'of Bleach'),
(8049, 'Bleach', 'a.', 'To make white, or whiter; to remove the color, or stains,\n   from; to blanch; to whiten.'),
(8050, 'Bleach', 'v. i.', 'To grow white or lose color; to whiten.'),
(8051, 'Bleached', 'a.', 'Whitened; make white.'),
(8052, 'Bleacher', 'n.', 'One who whitens, or whose occupation is to whiten, by\n   bleaching.'),
(8053, 'Bleak', 'a.', 'Without color; pale; pallid.'),
(8054, 'Bleak', 'a.', 'Desolate and exposed; swept by cold winds.'),
(8055, 'Bleak', 'a.', 'Cold and cutting; cheerless; as, a bleak blast.'),
(8056, 'Bleak', 'a.', 'A small European river fish (Leuciscus alburnus), of the\n   family Cyprinidae; the blay.'),
(8057, 'Bleaky', 'a.', 'Bleak.'),
(8058, 'Blear', 'v.', 'Dim or sore with water or rheum; -- said of the eyes.'),
(8059, 'Blear', 'v.', 'Causing or caused by dimness of sight; dim.'),
(8060, 'Bleared', 'imp. & p. p.', 'of Blear'),
(8061, 'Blearing', 'p. pr. & vb. n.', 'of Blear'),
(8062, 'Blear', 'v. t.', 'To make somewhat sore or watery, as the eyes; to dim, or\n   blur, as the sight. Figuratively: To obscure (mental or moral\n   perception); to blind; to hoodwink.'),
(8063, 'Bleared', 'a.', 'Dimmed, as by a watery humor; affected with rheum.'),
(8064, 'Bleareye', 'n.', 'A disease of the eyelids, consisting in chronic\n   inflammation of the margins, with a gummy secretion of sebaceous\n   matter.'),
(8065, 'Bleary', 'a.', 'Somewhat blear.'),
(8066, 'Bleated', 'imp. & p. p.', 'of Bleat'),
(8067, 'Bleating', 'p. pr. & vb. n.', 'of Bleat'),
(8068, 'Bleat', 'v. i.', 'To make the noise of, or one like that of, a sheep; to\n   cry like a sheep or calf.'),
(8069, 'Bleat', 'n.', 'A plaintive cry of, or like that of, a sheep.'),
(8070, 'Bleater', 'n.', 'One who bleats; a sheep.'),
(8071, 'Bleating', 'a.', 'Crying as a sheep does.'),
(8072, 'Bleating', 'n.', 'The cry of, or as of, a sheep.'),
(8073, 'Blebby', 'a.', 'Containing blebs, or characterized by blebs; as, blebby\n   glass.'),
(8074, 'Bleck', 'v. t.', 'Alt. of Blek'),
(8075, 'Bleeding', 'p. pr. & vb. n.', 'of Bleed'),
(8076, 'Bleed', 'v. i.', 'To emit blood; to lose blood; to run with blood, by\n   whatever means; as, the arm bleeds; the wound bled freely; to bleed at\n   the nose.'),
(8077, 'Bleed', 'v. i.', 'To withdraw blood from the body; to let blood; as, Dr. A.\n   bleeds in fevers.'),
(8078, 'Bleed', 'v. i.', 'To lose or shed one\'s blood, as in case of a violent\n   death or severe wounds; to die by violence.'),
(8079, 'Bleed', 'v. i.', 'To issue forth, or drop, as blood from an incision.'),
(8080, 'Bleed', 'v. i.', 'To lose sap, gum, or juice; as, a tree or a vine bleeds\n   when tapped or wounded.'),
(8081, 'Bleed', 'v. i.', 'To pay or lose money; to have money drawn or extorted;\n   as, to bleed freely for a cause.'),
(8082, 'Bleed', 'v. t.', 'To let blood from; to take or draw blood from, as by\n   opening a vein.'),
(8083, 'Bleed', 'v. t.', 'To lose, as blood; to emit or let drop, as sap.'),
(8084, 'Bleed', 'v. t.', 'To draw money from (one); to induce to pay; as, they bled\n   him freely for this fund.'),
(8085, 'Bleeder', 'n.', 'One who, or that which, draws blood.'),
(8086, 'Bleeder', 'n.', 'One in whom slight wounds give rise to profuse or\n   uncontrollable bleeding.'),
(8087, 'Bleeding', 'a.', 'Emitting, or appearing to emit, blood or sap, etc.; also,\n   expressing anguish or compassion.'),
(8088, 'Bleeding', 'n.', 'A running or issuing of blood, as from the nose or a\n   wound; a hemorrhage; the operation of letting blood, as in surgery; a\n   drawing or running of sap from a tree or plant.'),
(8089, 'Blemish', 'v. t.', 'To mark with deformity; to injure or impair, as\n   anything which is well formed, or excellent; to mar, or make defective,\n   either the body or mind.'),
(8090, 'Blemish', 'v. t.', 'To tarnish, as reputation or character; to defame.'),
(8091, 'Blemish', 'n.', 'Any mark of deformity or injury, whether physical or\n   moral; anything that diminishes beauty, or renders imperfect that which\n   is otherwise well formed; that which impairs reputation.'),
(8092, 'Blenched', 'imp. & p. p.', 'of Blench'),
(8093, 'Blench', 'v. i.', 'To shrink; to start back; to draw back, from lack of\n   courage or resolution; to flinch; to quail.'),
(8094, 'Blench', 'v. i.', 'To fly off; to turn aside.'),
(8095, 'Blench', 'v. t.', 'To baffle; to disconcert; to turn away; -- also, to\n   obstruct; to hinder.'),
(8096, 'Blench', 'v. t.', 'To draw back from; to deny from fear.'),
(8097, 'Blench', 'n.', 'A looking aside or askance.'),
(8098, 'Blench', 'v. i. & t.', 'To grow or make pale.'),
(8099, 'Blencher', 'n.', 'One who, or that which, scares another; specifically, a\n   person stationed to prevent the escape of the deer, at a hunt. See\n   Blancher.'),
(8100, 'Blencher', 'n.', 'One who blenches, flinches, or shrinks back.'),
(8101, 'Blended', 'imp. & p. p.', 'of Blend'),
(8102, 'Blent', '', 'of Blend'),
(8103, 'Blending', 'p. pr. & vb. n.', 'of Blend'),
(8104, 'Blend', 'v. t.', 'To mix or mingle together; esp. to mingle, combine, or\n   associate so that the separate things mixed, or the line of\n   demarcation, can not be distinguished. Hence: To confuse; to confound.'),
(8105, 'Blend', 'v. t.', 'To pollute by mixture or association; to spoil or\n   corrupt; to blot; to stain.'),
(8106, 'Blend', 'v. i.', 'To mingle; to mix; to unite intimately; to pass or shade\n   insensibly into each other, as colors.'),
(8107, 'Blend', 'n.', 'A thorough mixture of one thing with another, as color,\n   tint, etc., into another, so that it cannot be known where one ends or\n   the other begins.'),
(8108, 'Blend', 'a.', 'To make blind, literally or figuratively; to dazzle; to\n   deceive.'),
(8109, 'Blende', 'n.', 'A mineral, called also sphalerite, and by miners mock lead,\n   false galena, and black-jack. It is a zinc sulphide, but often contains\n   some iron. Its color is usually yellow, brown, or black, and its luster\n   resinous.'),
(8110, 'Blende', 'n.', 'A general term for some minerals, chiefly metallic\n   sulphides which have a somewhat brilliant but nonmetallic luster.'),
(8111, 'Blender', 'n.', 'One who, or that which, blends; an instrument, as a brush,\n   used in blending.'),
(8112, 'Blending', 'n.', 'The act of mingling.'),
(8113, 'Blending', 'n.', 'The method of laying on different tints so that they may\n   mingle together while wet, and shade into each other insensibly.'),
(8114, 'Blendous', 'a.', 'Pertaining to, consisting of, or containing, blende.'),
(8115, 'Blenk', 'v. i.', 'To blink; to shine; to look.'),
(8116, 'Blenniid', 'a.', 'Of, pertaining to, or resembling, the blennies.'),
(8117, 'Blennies', 'pl. ', 'of Blenny'),
(8118, 'Blenny', 'n.', 'A marine fish of the genus Blennius or family Blenniidae;\n   -- so called from its coating of mucus. The species are numerous.'),
(8119, 'Blent', 'imp. & p. p.', 'Mingled; mixed; blended; also, polluted; stained.'),
(8120, 'Blent', 'imp. & p. p.', 'Blinded. Also (Chaucer), 3d sing. pres. Blindeth.'),
(8121, 'Blesbok', 'n.', 'A South African antelope (Alcelaphus albifrons), having a\n   large white spot on the forehead.'),
(8122, 'Blessed', 'imp. & p. p.', 'of Bless'),
(8123, 'Blest', '', 'of Bless'),
(8124, 'Blessing', 'p. pr. & vb. n.', 'of Bless'),
(8125, 'Bless', 'v. t.', 'To make or pronounce holy; to consecrate'),
(8126, 'Bless', 'v. t.', 'To make happy, blithesome, or joyous; to confer\n   prosperity or happiness upon; to grant divine favor to.'),
(8127, 'Bless', 'v. t.', 'To express a wish or prayer for the happiness of; to\n   invoke a blessing upon; -- applied to persons.'),
(8128, 'Bless', 'v. t.', 'To invoke or confer beneficial attributes or qualities\n   upon; to invoke or confer a blessing on, -- as on food.'),
(8129, 'Bless', 'v. t.', 'To make the sign of the cross upon; to cross (one\'s\n   self).'),
(8130, 'Bless', 'v. t.', 'To guard; to keep; to protect.'),
(8131, 'Bless', 'v. t.', 'To praise, or glorify; to extol for excellences.'),
(8132, 'Bless', 'v. t.', 'To esteem or account happy; to felicitate.'),
(8133, 'Bless', 'v. t.', 'To wave; to brandish.'),
(8134, 'Blessed', 'a.', 'Hallowed; consecrated; worthy of blessing or adoration;\n   heavenly; holy.'),
(8135, 'Blessed', 'a.', 'Enjoying happiness or bliss; favored with blessings;\n   happy; highly favored.'),
(8136, 'Blessed', 'a.', 'Imparting happiness or bliss; fraught with happiness;\n   blissful; joyful.'),
(8137, 'Blessed', 'a.', 'Enjoying, or pertaining to, spiritual happiness, or\n   heavenly felicity; as, the blessed in heaven.'),
(8138, 'Blessed', 'a.', 'Beatified.'),
(8139, 'Blessed', 'a.', 'Used euphemistically, ironically, or intensively.'),
(8140, 'Blesser', 'n.', 'One who blesses; one who bestows or invokes a blessing.'),
(8141, 'Blessing', 'v. t.', 'The act of one who blesses.'),
(8142, 'Blessing', 'v. t.', 'A declaration of divine favor, or an invocation\n   imploring divine favor on some or something; a benediction; a wish of\n   happiness pronounces.'),
(8143, 'Blessing', 'v. t.', 'A means of happiness; that which promotes prosperity\n   and welfare; a beneficent gift.'),
(8144, 'Blessing', 'v. t.', 'A gift.'),
(8145, 'Blessing', 'v. t.', 'Grateful praise or worship.'),
(8146, 'Blest', 'a.', 'Blessed.'),
