(8369, 'Blow-off', 'adj.', 'as, a blow-off cock or pipe.'),
(8370, 'Blow-off', 'adj.', 'An outburst of temper or excitement.'),
(8371, 'Blow-out', 'n.', 'The cleaning of the flues of a boiler from scale, etc.,\n   by a blast of steam.'),
(8372, 'Blowpipe', 'n.', 'A tube for directing a jet of air into a fire or into the\n   flame of a lamp or candle, so as to concentrate the heat on some\n   object.'),
(8373, 'Blowpipe', 'n.', 'A blowgun; a blowtube.'),
(8374, 'Blowse', 'n.', 'See Blowze.'),
(8375, 'Blowth', 'n.', 'A blossoming; a bloom.'),
(8376, 'Blowtube', 'n.', 'A blowgun.'),
(8377, 'Blowtube', 'n.', 'A similar instrument, commonly of tin, used by boys for\n   discharging paper wads and other light missiles.'),
(8378, 'Blowtube', 'n.', 'A long wrought iron tube, on the end of which the workman\n   gathers a quantity of \"metal\" (melted glass), and through which he\n   blows to expand or shape it; -- called also blowing tube, and blowpipe.'),
(8379, 'Blowy', 'a.', 'Windy; as, blowy weather; a blowy upland.'),
(8380, 'Blowze', 'n.', 'A ruddy, fat-faced woman; a wench.'),
(8381, 'Blowzed', 'a.', 'Having high color from exposure to the weather;\n   ruddy-faced; blowzy; disordered.'),
(8382, 'Blowzy', 'a.', 'Coarse and ruddy-faced; fat and ruddy; high colored;\n   frowzy.'),
(8383, 'Blubber', 'n.', 'A bubble.'),
(8384, 'Blubber', 'n.', 'The fat of whales and other large sea animals from which\n   oil is obtained. It lies immediately under the skin and over the\n   muscular flesh.'),
(8385, 'Blubber', 'n.', 'A large sea nettle or medusa.'),
(8386, 'Blubber', 'v. i.', 'To weep noisily, or so as to disfigure the face; to cry\n   in a childish manner.'),
(8387, 'Blubber', 'v. t.', 'To swell or disfigure (the face) with weeping; to wet\n   with tears.'),
(8388, 'Blubber', 'v. t.', 'To give vent to (tears) or utter (broken words or\n   cries); -- with forth or out.'),
(8389, 'Blubbery', 'a.', 'Swollen; protuberant.'),
(8390, 'Blubbery', 'a.', 'Like blubber; gelatinous and quivering; as, a blubbery\n   mass.'),
(8391, 'Blucher', 'n.', 'A kind of half boot, named from the Prussian general\n   Blucher.'),
(8392, 'Bludgeon', 'n.', 'A short stick, with one end loaded, or thicker and\n   heavier that the other, used as an offensive weapon.'),
(8393, 'Blued', 'imp. & p. p.', 'of Blue'),
(8394, 'Bluing', 'p. pr. & vb. n.', 'of Blue'),
(8395, 'Blueback', 'n.', 'A trout (Salmo oquassa) inhabiting some of the lakes of\n   Maine.'),
(8396, 'Blueback', 'n.', 'A salmon (Oncorhynchus nerka) of the Columbia River and\n   northward.'),
(8397, 'Blueback', 'n.', 'An American river herring (Clupea aestivalis), closely\n   allied to the alewife.'),
(8398, 'Bluebell', 'n.', 'A plant of the genus Campanula, especially the Campanula\n   rotundifolia, which bears blue bell-shaped flowers; the harebell.'),
(8399, 'Bluebell', 'n.', 'A plant of the genus Scilla (Scilla nutans).'),
(8400, 'Bluebill', 'n.', 'A duck of the genus Fuligula. Two American species (F.\n   marila and F. affinis) are common. See Scaup duck.'),
(8401, 'Bluebird', 'n.', 'A small song bird (Sialia sialis), very common in the\n   United States, and, in the north, one of the earliest to arrive in\n   spring. The male is blue, with the breast reddish. It is related to the\n   European robin.'),
(8402, 'Bluecap', 'n.', 'The bluepoll.'),
(8403, 'Bluecap', 'n.', 'The blue bonnet or blue titmouse.'),
(8404, 'Bluecap', 'n.', 'A Scot; a Scotchman; -- so named from wearing a blue\n   bonnet.'),
(8405, 'Bluecoat', 'n.', 'One dressed in blue, as a soldier, a sailor, a beadle,\n   etc.'),
(8406, 'Blue-eye', 'n.', 'The blue-cheeked honeysucker of Australia.'),
(8407, 'Bluefin', 'n.', 'A species of whitefish (Coregonus nigripinnis) found in\n   Lake Michigan.'),
(8408, 'Bluefish', 'n.', 'A large voracious fish (Pomatomus saitatrix), of the\n   family Carangidae, valued as a food fish, and widely distributed on the\n   American coast. On the New Jersey and Rhode Island coast it is called\n   the horse mackerel, in Virginia saltwater tailor, or skipjack.'),
(8409, 'Bluefish', 'n.', 'A West Indian fish (Platyglossus radiatus), of the family\n   Labridae.'),
(8410, 'Bluegown', 'n.', 'One of a class of paupers or pensioners, or licensed\n   beggars, in Scotland, to whim annually on the king\'s birthday were\n   distributed certain alms, including a blue gown; a beadsman.'),
(8411, 'Blue jay', '', 'The common jay of the United States (Cyanocitta, or\n   Cyanura, cristata). The predominant color is bright blue.'),
(8412, 'Bluely', 'adv.', 'With a blue color.'),
(8413, 'Blueness', 'n.', 'The quality of being blue; a blue color.'),
(8414, 'Bluenose', 'n.', 'A nickname for a Nova Scotian.'),
(8415, 'Bluepoll', 'n.', 'A kind of salmon (Salmo Cambricus) found in Wales.'),
(8416, 'Bluets', 'a.', 'A name given to several different species of plants having\n   blue flowers, as the Houstonia coerulea, the Centaurea cyanus or\n   bluebottle, and the Vaccinium angustifolium.'),
(8417, 'Bluewing', 'n.', 'The blue-winged teal. See Teal.'),
(8418, 'Bluey', 'a.', 'Bluish.'),
(8419, 'Bluff', 'a.', 'Having a broad, flattened front; as, the bluff bows of a\n   ship.'),
(8420, 'Bluff', 'a.', 'Rising steeply with a flat or rounded front.'),
(8421, 'Bluff', 'a.', 'Surly; churlish; gruff; rough.'),
(8422, 'Bluff', 'a.', 'Abrupt; roughly frank; unceremonious; blunt; brusque; as, a\n   bluff answer; a bluff manner of talking; a bluff sea captain.'),
(8423, 'Bluff', 'n.', 'A high, steep bank, as by a river or the sea, or beside a\n   ravine or plain; a cliff with a broad face.'),
(8424, 'Bluff', 'n.', 'An act of bluffing; an expression of self-confidence for the\n   purpose of intimidation; braggadocio; as, that is only bluff, or a\n   bluff.'),
(8425, 'Bluff', 'n.', 'A game at cards; poker.'),
(8426, 'Bluffed', 'imp. & p. p.', 'of Bluff'),
(8427, 'Bluffing', 'p. pr. & vb. n.', 'of Bluff'),
(8428, 'Bluff', 'v. t.', 'To deter (an opponent) from taking the risk of betting on\n   his hand of cards, as the bluffer does by betting heavily on his own\n   hand although it may be of less value.'),
(8429, 'Bluff', 'v. t.', 'To frighten or deter from accomplishing a purpose by\n   making a show of confidence in one\'s strength or resources; as, he\n   bluffed me off.'),
(8430, 'Bluff', 'v. i.', 'To act as in the game of bluff.'),
(8431, 'Bluffer', 'n.', 'One who bluffs.'),
(8432, 'Bluffy', 'a.', 'Having bluffs, or bold, steep banks.'),
(8433, 'Bluffy', 'a.', 'Inclined to bo bluff; brusque.'),
(8434, 'Bluing', 'n.', 'The act of rendering blue; as, the bluing of steel.'),
(8435, 'Bluing', 'n.', 'Something to give a bluish tint, as indigo, or preparations\n   used by washerwomen.'),
(8436, 'Bluish', 'a.', 'Somewhat blue; as, bluish veins.'),
(8437, 'Blunder', 'v. i.', 'To make a gross error or mistake; as, to blunder in\n   writing or preparing a medical prescription.'),
(8438, 'Blunder', 'v. i.', 'To move in an awkward, clumsy manner; to flounder and\n   stumble.'),
(8439, 'Blunder', 'v. t.', 'To cause to blunder.'),
(8440, 'Blunder', 'v. t.', 'To do or treat in a blundering manner; to confuse.'),
(8441, 'Blunder', 'n.', 'Confusion; disturbance.'),
(8442, 'Blunder', 'n.', 'A gross error or mistake, resulting from carelessness,\n   stupidity, or culpable ignorance.'),
(8443, 'Blunge', 'v. t.', 'To amalgamate and blend; to beat up or mix in water, as\n   clay.'),
(8444, 'Blunger', 'n.', 'A wooden blade with a cross handle, used for mi/ing the\n   clay in potteries; a plunger.'),
(8445, 'Blunging', 'n.', 'The process of mixing clay in potteries with a blunger.'),
(8446, 'Blunt', 'a.', 'Having a thick edge or point, as an instrument; dull; not\n   sharp.'),
(8447, 'Blunt', 'a.', 'Dull in understanding; slow of discernment; stupid; --\n   opposed to acute.'),
(8448, 'Blunt', 'a.', 'Abrupt in address; plain; unceremonious; wanting the forms\n   of civility; rough in manners or speech.'),
(8449, 'Blunt', 'a.', 'Hard to impress or penetrate.'),
(8450, 'Blunted', 'imp. & p. p.', 'of Blunt'),
(8451, 'Blunting', 'p. pr. & vb. n.', 'of Blunt'),
(8452, 'Blunt', 'v. t.', 'To dull the edge or point of, by making it thicker; to\n   make blunt.'),
(8453, 'Blunt', 'v. t.', 'To repress or weaken, as any appetite, desire, or power\n   of the mind; to impair the force, keenness, or susceptibility, of; as,\n   to blunt the feelings.'),
(8454, 'Blunt', 'n.', 'A fencer\'s foil.'),
(8455, 'Blunt', 'n.', 'A short needle with a strong point. See Needle.'),
(8456, 'Blunt', 'n.', 'Money.'),
(8457, 'Bluntish', 'a.', 'Somewhat blunt.'),
(8458, 'Bluntly', 'adv.', 'In a blunt manner; coarsely; plainly; abruptly; without\n   delicacy, or the usual forms of civility.'),
(8459, 'Blurred', 'imp. & p. p.', 'of Blur'),
(8460, 'Blurring', 'p. pr. & vb. n.', 'of Blur'),
(8461, 'Blurry', 'a.', 'Full of blurs; blurred.'),
(8462, 'Blurted', 'imp. & p. p.', 'of Blurt'),
(8463, 'Blurting', 'p. pr. & vb. n.', 'of Blurt'),
(8464, 'Blurt', 'v. t.', 'To utter suddenly and unadvisedly; to divulge\n   inconsiderately; to ejaculate; -- commonly with out.'),
(8465, 'Blushed', 'imp. & p. p.', 'of Blush'),
(8466, 'Blushing', 'p. pr. & vb. n.', 'of Blush'),
(8467, 'Blush', 'v. i.', 'To become suffused with red in the cheeks, as from a\n   sense of shame, modesty, or confusion; to become red from such cause,\n   as the cheeks or face.'),
(8468, 'Blush', 'v. i.', 'To grow red; to have a red or rosy color.'),
(8469, 'Blush', 'v. i.', 'To have a warm and delicate color, as some roses and\n   other flowers.'),
(8470, 'Blush', 'v. t.', 'To suffuse with a blush; to redden; to make roseate.'),
(8471, 'Blush', 'v. t.', 'To express or make known by blushing.'),
(8472, 'Blush', 'n.', 'A suffusion of the cheeks or face with red, as from a sense\n   of shame, confusion, or modesty.'),
(8473, 'Blush', 'n.', 'A red or reddish color; a rosy tint.'),
(8474, 'Blusher', 'n.', 'One that blushes.'),
(8475, 'Blushet', 'n.', 'A modest girl.'),
(8476, 'Blushful', 'a.', 'Full of blushes.'),
(8477, 'Blushing', 'a.', 'Showing blushes; rosy red; having a warm and delicate\n   color like some roses and other flowers; blooming; ruddy; roseate.'),
(8478, 'Blushing', 'n.', 'The act of turning red; the appearance of a reddish color\n   or flush upon the cheeks.'),
(8479, 'Blushy', 'a.', 'Like a blush; having the color of a blush; rosy.'),
(8480, 'Bluster', 'v. i.', 'To blow fitfully with violence and noise, as wind; to\n   be windy and boisterous, as the weather.'),
(8481, 'Bluster', 'v. i.', 'To talk with noisy violence; to swagger, as a turbulent\n   or boasting person; to act in a noisy, tumultuous way; to play the\n   bully; to storm; to rage.'),
(8482, 'Bluster', 'v. t.', 'To utter, or do, with noisy violence; to force by\n   blustering; to bully.'),
(8483, 'Bluster', 'n.', 'Fitful noise and violence, as of a storm; violent winds;\n   boisterousness.'),
(8484, 'Bluster', 'n.', 'Noisy and violent or threatening talk; noisy and boastful\n   language.'),
(8485, 'Board', 'n.', 'A piece of timber sawed thin, and of considerable length and\n   breadth as compared with the thickness, -- used for building, etc.'),
(8486, 'Board', 'n.', 'A table to put food upon.'),
(8487, 'Board', 'n.', 'Hence: What is served on a table as food; stated meals;\n   provision; entertainment; -- usually as furnished for pay; as, to work\n   for one\'s board; the price of board.'),
(8488, 'Board', 'n.', 'A table at which a council or court is held. Hence: A\n   council, convened for business, or any authorized assembly or meeting,\n   public or private; a number of persons appointed or elected to sit in\n   council for the management or direction of some public or private\n   business or trust; as, the Board of Admiralty; a board of trade; a\n   board of directors, trustees, commissioners, etc.'),
(8489, 'Board', 'n.', 'A square or oblong piece of thin wood or other material used\n   for some special purpose, as, a molding board; a board or surface\n   painted or arranged for a game; as, a chessboard; a backgammon board.'),
(8490, 'Board', 'n.', 'Paper made thick and stiff like a board, for book covers,\n   etc.; pasteboard; as, to bind a book in boards.'),
(8491, 'Board', 'n.', 'The stage in a theater; as, to go upon the boards, to enter\n   upon the theatrical profession.'),
(8492, 'Board', 'n.', 'The border or side of anything.'),
(8493, 'Board', 'n.', 'The side of a ship.'),
(8494, 'Board', 'n.', 'The stretch which a ship makes in one tack.'),
(8495, 'Boarded', 'imp. & p. p.', 'of Board'),
(8496, 'Boarding', 'p. pr. & vb. n.', 'of Board'),
(8497, 'Board', 'v. t.', 'To cover with boards or boarding; as, to board a house.'),
(8498, 'Board', 'n.', 'To go on board of, or enter, as a ship, whether in a hostile\n   or a friendly way.'),
(8499, 'Board', 'n.', 'To enter, as a railway car.'),
(8500, 'Board', 'n.', 'To furnish with regular meals, or with meals and lodgings,\n   for compensation; to supply with daily meals.'),
(8501, 'Board', 'n.', 'To place at board, for compensation; as, to board one\'s\n   horse at a livery stable.'),
(8502, 'Board', 'v. i.', 'To obtain meals, or meals and lodgings, statedly for\n   compensation; as, he boards at the hotel.'),
(8503, 'Board', 'v. t.', 'To approach; to accost; to address; hence, to woo.'),
(8504, 'Boarder', 'n.', 'One who has food statedly at another\'s table, or meals and\n   lodgings in his house, for pay, or compensation of any kind.'),
(8505, 'Boarder', 'n.', 'One who boards a ship; one selected to board an enemy\'s\n   ship.'),
(8506, 'Boarding', 'n.', 'The act of entering a ship, whether with a hostile or a\n   friendly purpose.'),
(8507, 'Boarding', 'n.', 'The act of covering with boards; also, boards,\n   collectively; or a covering made of boards.'),
(8508, 'Boarding', 'n.', 'The act of supplying, or the state of being supplied,\n   with regular or specified meals, or with meals and lodgings, for pay.'),
(8509, 'Boarfish', 'n.', 'A Mediterranean fish (Capros aper), of the family\n   Caproidae; -- so called from the resemblance of the extended lips to a\n   hog\'s snout.'),
(8510, 'Boarfish', 'n.', 'An Australian percoid fish (Histiopterus recurvirostris),\n   valued as a food fish.'),
(8511, 'Boarish', 'a.', 'Swinish; brutal; cruel.'),
(8512, 'Boasted', 'imp. & p. p.', 'of Boast'),
(8513, 'Boasting', 'p. pr. & vb. n.', 'of Boast'),
(8514, 'Boast', 'v. i.', 'To vaunt one\'s self; to brag; to say or tell things which\n   are intended to give others a high opinion of one\'s self or of things\n   belonging to one\'s self; as, to boast of one\'s exploits courage,\n   descent, wealth.'),
(8515, 'Boast', 'v. i.', 'To speak in exulting language of another; to glory; to\n   exult.'),
(8516, 'Boast', 'v. t.', 'To display in ostentatious language; to speak of with\n   pride, vanity, or exultation, with a view to self-commendation; to\n   extol.'),
(8517, 'Boast', 'v. t.', 'To display vaingloriously.'),
(8518, 'Boast', 'v. t.', 'To possess or have; as, to boast a name.'),
(8519, 'Boast', 'v. t.', 'To dress, as a stone, with a broad chisel.'),
(8520, 'Boast', 'v. t.', 'To shape roughly as a preparation for the finer work to\n   follow; to cut to the general form required.'),
(8521, 'Boast', 'n.', 'Act of boasting; vaunting or bragging.'),
(8522, 'Boast', 'n.', 'The cause of boasting; occasion of pride or exultation, --\n   sometimes of laudable pride or exultation.'),
(8523, 'Boaster', 'n.', 'One who boasts; a braggart.'),
(8524, 'Boaster', 'n.', 'A stone mason\'s broad-faced chisel.'),
(8525, 'Boastful', 'a.', 'Given to, or full of, boasting; inclined to boast;\n   vaunting; vainglorious; self-praising.'),
(8526, 'Boasting', 'n.', 'The act of glorying or vaunting; vainglorious speaking;\n   ostentatious display.'),
(8527, 'Boastive', 'a.', 'Presumptuous.'),
(8528, 'Boated', 'imp. & p. p.', 'of Boat'),
(8529, 'Boating', 'p. pr. & vb. n.', 'of Boat');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(8530, 'Boatable', 'a.', 'Such as can be transported in a boat.'),
(8531, 'Boatable', 'a.', 'Navigable for boats, or small river craft.'),
(8532, 'Boatage', 'n.', 'Conveyance by boat; also, a charge for such conveyance.'),
(8533, 'Boatbill', 'n.', 'A wading bird (Cancroma cochlearia) of the tropical parts\n   of South America. Its bill is somewhat like a boat with the keel\n   uppermost.'),
(8534, 'Boatbill', 'n.', 'A perching bird of India, of the genus Eurylaimus.'),
(8535, 'Boat bug', '', 'An aquatic hemipterous insect of the genus Notonecta; -- so\n   called from swimming on its back, which gives it the appearance of a\n   little boat. Called also boat fly, boat insect, boatman, and water\n   boatman.'),
(8536, 'Boatfuls', 'pl. ', 'of Boatful'),
(8537, 'Boatful', 'n.', 'The quantity or amount that fills a boat.'),
(8538, 'Boating', 'n.', 'The act or practice of rowing or sailing, esp. as an\n   amusement; carriage in boats.'),
(8539, 'Boating', 'n.', 'In Persia, a punishment of capital offenders, by laying\n   them on the back in a covered boat, where they are left to perish.'),
(8540, 'Boation', 'n.', 'A crying out; a roaring; a bellowing; reverberation.'),
(8541, 'Boatmen', 'pl. ', 'of Boatman'),
(8542, 'Boatman', 'n.', 'A man who manages a boat; a rower of a boat.'),
(8543, 'Boatman', 'n.', 'A boat bug. See Boat bug.'),
(8544, 'Boatsman', 'n.', 'A boatman.'),
(8545, 'Bobbed', 'imp. & p. p.', 'of Bob'),
(8546, 'Bobbing', 'p. pr. & vb. n.', 'of Bob'),
(8547, 'Bobac', 'n.', 'The Poland marmot (Arctomys bobac).'),
(8548, 'Bobance', 'n.', 'A boasting.'),
(8549, 'Bobber', 'n.', 'One who, or that which, bobs.'),
(8550, 'Bobbery', 'n.', 'A squabble; a tumult; a noisy disturbance; as, to raise a\n   bobbery.'),
(8551, 'Bobbin', 'n.', 'A small pin, or cylinder, formerly of bone, now most\n   commonly of wood, used in the making of pillow lace. Each thread is\n   wound on a separate bobbin which hangs down holding the thread at a\n   slight tension.'),
(8552, 'Bobbin', 'n.', 'A spool or reel of various material and construction, with\n   a head at one or both ends, and sometimes with a hole bored through its\n   length by which it may be placed on a spindle or pivot. It is used to\n   hold yarn or thread, as in spinning or warping machines, looms, sewing\n   machines, etc.'),
(8553, 'Bobbin', 'n.', 'The little rounded piece of wood, at the end of a latch\n   string, which is pulled to raise the latch.'),
(8554, 'Bobbin', 'n.', 'A fine cord or narrow braid.'),
(8555, 'Bobbin', 'n.', 'A cylindrical or spool-shaped coil or insulated wire,\n   usually containing a core of soft iron which becomes magnetic when the\n   wire is traversed by an electrical current.'),
(8556, 'Bobbinet', 'n.', 'A kind of cotton lace which is wrought by machines, and\n   not by hand.'),
(8557, 'Bobbish', 'a.', 'Hearty; in good spirits.'),
(8558, 'Bobby', 'n.', 'A nickname for a policeman; -- from Sir Robert Peel, who\n   remodeled the police force. See Peeler.'),
(8559, 'Bobfly', 'n.', 'The fly at the end of the leader; an end fly.'),
(8560, 'Bobolink', 'n.', 'An American singing bird (Dolichonyx oryzivorus). The\n   male is black and white; the female is brown; -- called also, ricebird,\n   reedbird, and Boblincoln.'),
(8561, 'Bobsled', 'n.', 'Alt. of Bobsleigh'),
(8562, 'Bobstay', 'n.', 'A rope or chain to confine the bowsprit of a ship downward\n   to the stem or cutwater; -- usually in the pl.'),
(8563, 'Bobtail', 'n.', 'An animal (as a horse or dog) with a short tail.'),
(8564, 'Bobtail', 'a.', 'Bobtailed.'),
(8565, 'Bobwhite', 'n.', 'The common quail of North America (Colinus, or Ortyx,\n   Virginianus); -- so called from its note.'),
(8566, 'Bob wig', '', 'A short wig with bobs or short curls; -- called also bobtail\n   wig.'),
(8567, 'Bocal', 'n.', 'A cylindrical glass vessel, with a large and short neck.'),
(8568, 'Bocardo', 'n.', 'A form of syllogism of which the first and third\n   propositions are particular negatives, and the middle term a universal\n   affirmative.'),
(8569, 'Bocardo', 'n.', 'A prison; -- originally the name of the old north gate in\n   Oxford, which was used as a prison.'),
(8570, 'Bocasine', 'n.', 'A sort of fine buckram.'),
(8571, 'Bocca', 'n.', 'The round hole in the furnace of a glass manufactory through\n   which the fused glass is taken out.'),
(8572, 'Bockelet', 'n.', 'A kind of long-winged hawk; -- called also bockerel, and\n   bockeret.'),
(8573, 'Bockey', 'n.', 'A bowl or vessel made from a gourd.'),
(8574, 'Bocking', 'n.', 'A coarse woolen fabric, used for floor cloths, to cover\n   carpets, etc.; -- so called from the town of Bocking, in England, where\n   it was first made.'),
(8575, 'Bockland', 'n.', 'See Bookland.'),
(8576, 'Boddice', 'n.', 'See Bodick.'),
(8577, 'Boded', 'imp. & p. p.', 'of Bode'),
(8578, 'Boding', 'p. pr. & vb. n.', 'of Bode'),
(8579, 'Bodeful', 'a.', 'Portentous; ominous.'),
(8580, 'Bodement', 'n.', 'An omen; a prognostic.'),
(8581, 'Bodge', 'n.', 'A botch; a patch.'),
(8582, 'Bodged', 'imp. & p. p.', 'of Bodge'),
(8583, 'Bodge', 'v. t.', 'To botch; to mend clumsily; to patch.'),
(8584, 'Bodge', 'v. i.', 'See Budge.'),
(8585, 'Bodian', 'n.', 'A large food fish (Diagramma lineatum), native of the East\n   Indies.'),
(8586, 'Bodice', 'n.', 'A kind of under waist stiffened with whalebone, etc., worn\n   esp. by women; a corset; stays.'),
(8587, 'Bodice', 'n.', 'A close-fitting outer waist or vest forming the upper part\n   of a woman\'s dress, or a portion of it.'),
(8588, 'Bodiced', 'a.', 'Wearing a bodice.'),
(8589, 'Bodied', 'a.', 'Having a body; -- usually in composition; as, able-bodied.'),
(8590, 'Bodiless', 'a.', 'Having no body.'),
(8591, 'Bodiless', 'a.', 'Without material form; incorporeal.'),
(8592, 'Bodily', 'a.', 'Having a body or material form; physical; corporeal;\n   consisting of matter.'),
(8593, 'Bodily', 'a.', 'Of or pertaining to the body, in distinction from the mind.'),
(8594, 'Bodily', 'a.', 'Real; actual; put in execution.'),
(8595, 'Bodily', 'adv.', 'Corporeally; in bodily form; united with a body or\n   matter; in the body.'),
(8596, 'Bodily', 'adv.', 'In respect to, or so as to affect, the entire body or\n   mass; entirely; all at once; completely; as, to carry away bodily.\n   \"Leapt bodily below.\"'),
(8597, 'Boding', 'a.', 'Foreshowing; presaging; ominous.'),
(8598, 'Boding', 'n.', 'A prognostic; an omen; a foreboding.'),
(8599, 'Bodkin', 'n.', 'A dagger.'),
(8600, 'Bodkin', 'n.', 'An implement of steel, bone, ivory, etc., with a sharp\n   point, for making holes by piercing; a /tiletto; an eyeleteer.'),
