(8845, 'Bookish', 'a.', 'Given to reading; fond of study; better acquainted with\n   books than with men; learned from books.'),
(8846, 'Bookish', 'a.', 'Characterized by a method of expression generally found in\n   books; formal; labored; pedantic; as, a bookish way of talking; bookish\n   sentences.'),
(8847, 'Bookland', 'n.', 'Alt. of Bockland'),
(8848, 'Bockland', 'n.', 'Charter land held by deed under certain rents and free\n   services, which differed in nothing from free socage lands. This\n   species of tenure has given rise to the modern freeholds.'),
(8849, 'Bookless', 'a.', 'Without books; unlearned.'),
(8850, 'Booklet', 'n.', 'A little book.'),
(8851, 'Bookmen', 'pl. ', 'of Bookman'),
(8852, 'Bookman', 'n.', 'A studious man; a scholar.'),
(8853, 'Bookmark', 'n.', 'Something placed in a book to guide in finding a\n   particular page or passage; also, a label in a book to designate the\n   owner; a bookplate.'),
(8854, 'Bookmate', 'n.', 'A schoolfellow; an associate in study.'),
(8855, 'Bookshop', 'n.', 'A bookseller\'s shop.'),
(8856, 'Bookwork', 'n.', 'Work done upon a book or books (as in a printing office),\n   in distinction from newspaper or job work.'),
(8857, 'Bookwork', 'n.', 'Study; application to books.'),
(8858, 'Bookworm', 'n.', 'Any larva of a beetle or moth, which is injurious to\n   books. Many species are known.'),
(8859, 'Bookworm', 'n.', 'A student closely attached to books or addicted to study;\n   a reader without appreciation.'),
(8860, 'Booky', 'a.', 'Bookish.'),
(8861, 'Boolies', 'pl. ', 'of Booly'),
(8862, 'Booly', 'n.', 'A company of Irish herdsmen, or a single herdsman, wandering\n   from place to place with flocks and herds, and living on their milk,\n   like the Tartars; also, a place in the mountain pastures inclosed for\n   the shelter of cattle or their keepers.'),
(8863, 'Boomed', 'imp. & p. p.', 'of Boom'),
(8864, 'Booming', 'p. pr. & vb. n.', 'of Boom'),
(8865, 'Boomdas', 'n.', 'A small African hyracoid mammal (Dendrohyrax arboreus)\n   resembling the daman.'),
(8866, 'Boomer', 'n.', 'One who, or that which, booms.'),
(8867, 'Boomer', 'n.', 'A North American rodent, so named because it is said to\n   make a booming noise. See Sewellel.'),
(8868, 'Boomer', 'n.', 'A large male kangaroo.'),
(8869, 'Boomer', 'n.', 'One who works up a \"boom\".'),
(8870, 'Booming', 'a.', 'Rushing with violence; swelling with a hollow sound;\n   making a hollow sound or note; roaring; resounding.'),
(8871, 'Booming', 'a.', 'Advancing or increasing amid noisy excitement; as, booming\n   prices; booming popularity.'),
(8872, 'Booming', 'n.', 'The act of producing a hollow or roaring sound; a violent\n   rushing with heavy roar; as, the booming of the sea; a deep, hollow\n   sound; as, the booming of bitterns.'),
(8873, 'Boomkin', 'n.', 'Same as Bumkin.'),
(8874, 'Boomorah', 'n.', 'A small West African chevrotain (Hyaemoschus aquaticus),\n   resembling the musk deer.'),
(8875, 'Boorish', 'a.', 'Like a boor; clownish; uncultured; unmannerly.'),
(8876, 'Boort', 'n.', 'See Bort.'),
(8877, 'Boose', 'n.', 'A stall or a crib for an ox, cow, or other animal.'),
(8878, 'Boose', 'v. i.', 'To drink excessively. See Booze.'),
(8879, 'Booser', 'n.', 'A toper; a guzzler. See Boozer.'),
(8880, 'Boosted', 'imp. & p. p.', 'of Boost'),
(8881, 'Boosting', 'p. pr. & vb. n.', 'of Boost'),
(8882, 'Boost', 'v. i.', 'To lift or push from behind (one who is endeavoring to\n   climb); to push up; hence, to assist in overcoming obstacles, or in\n   making advancement.'),
(8883, 'Boost', 'n.', 'A push from behind, as to one who is endeavoring to climb;\n   help.'),
(8884, 'Booted', 'imp. & p. p.', 'of Boot'),
(8885, 'Booting', 'p. pr. & vb. n.', 'of Boot'),
(8886, 'Booted', 'imp. & p. p.', 'of Boot'),
(8887, 'Booting', 'p. pr. & vb. n.', 'of Boot'),
(8888, 'Booted', 'a.', 'Wearing boots, especially boots with long tops, as for\n   riding; as, a booted squire.'),
(8889, 'Booted', 'a.', 'Having an undivided, horny, bootlike covering; -- said of\n   the tarsus of some birds.'),
(8890, 'Bootee', 'n.', 'A half boot or short boot.'),
(8891, 'Bootes', 'n.', 'A northern constellation, containing the bright star\n   Arcturus.'),
(8892, 'Booth', 'n.', 'A house or shed built of boards, boughs, or other slight\n   materials, for temporary occupation.'),
(8893, 'Booth', 'n.', 'A covered stall or temporary structure in a fair or market,\n   or at a polling place.'),
(8894, 'Boothale', 'v. t. & i.', 'To forage for booty; to plunder.'),
(8895, 'Boothose', 'n.', 'Stocking hose, or spatterdashes, in lieu of boots.'),
(8896, 'Boothose', 'n.', 'Hose made to be worn with boots, as by travelers on\n   horseback.'),
(8897, 'Boothy', 'n.', 'See Bothy.'),
(8898, 'Bootikin', 'n.', 'A little boot, legging, or gaiter.'),
(8899, 'Bootikin', 'n.', 'A covering for the foot or hand, worn as a cure for the\n   gout.'),
(8900, 'Booting', 'n.', 'Advantage; gain; gain by plunder; booty.'),
(8901, 'Booting', 'n.', 'A kind of torture. See Boot, n., 2.'),
(8902, 'Booting', 'n.', 'A kicking, as with a booted foot.'),
(8903, 'Bootjack', 'n.', 'A device for pulling off boots.'),
(8904, 'Bootless', 'a.', 'Unavailing; unprofitable; useless; without advantage or\n   success.'),
(8905, 'Bootlick', 'n.', 'A toady.'),
(8906, 'Boots', 'n.', 'A servant at a hotel or elsewhere, who cleans and blacks the\n   boots and shoes.'),
(8907, 'Boottree', 'n.', 'An instrument to stretch and widen the leg of a boot,\n   consisting of two pieces, together shaped like a leg, between which,\n   when put into the boot, a wedge is driven.'),
(8908, 'Booty', 'n.', 'That which is seized by violence or obtained by robbery,\n   especially collective spoil taken in war; plunder; pillage.'),
(8909, 'Boozed', 'imp. & p. p.', 'of Booze'),
(8910, 'Boozing', 'p. pr. & vb. n.', 'of Booze'),
(8911, 'Booze', 'v. i.', 'To drink greedily or immoderately, esp. alcoholic liquor;\n   to tipple.'),
(8912, 'Booze', 'n.', 'A carouse; a drinking.'),
(8913, 'Boozer', 'n.', 'One who boozes; a toper; a guzzler of alcoholic liquors; a\n   bouser.'),
(8914, 'Boozy', 'a.', 'A little intoxicated; fuddled; stupid with liquor; bousy.'),
(8915, 'Bopeep', 'n.', 'The act of looking out suddenly, as from behind a screen,\n   so as to startle some one (as by children in play), or of looking out\n   and drawing suddenly back, as if frightened.'),
(8916, 'Borable', 'a.', 'Capable of being bored.'),
(8917, 'Borachte', 'n.', 'A large leather bottle for liquors, etc., made of the\n   skin of a goat or other animal. Hence: A drunkard.'),
(8918, 'Boracic', 'a.', 'Pertaining to, or produced from, borax; containing boron;\n   boric; as, boracic acid.'),
(8919, 'Boracite', 'n.', 'A mineral of a white or gray color occurring massive and\n   in isometric crystals; in composition it is a magnesium borate with\n   magnesium chloride.'),
(8920, 'Boracous', 'a.', 'Relating to, or obtained from, borax; containing borax.'),
(8921, 'Borage', 'n.', 'A mucilaginous plant of the genus Borago (B. officinalis),\n   which is used, esp. in France, as a demulcent and diaphoretic.'),
(8922, 'Boramez', 'n.', 'See Barometz.'),
(8923, 'Borate', 'n.', 'A salt formed by the combination of boric acid with a base\n   or positive radical.'),
(8924, 'Borax', 'n.', 'A white or gray crystalline salt, with a slight alkaline\n   taste, used as a flux, in soldering metals, making enamels, fixing\n   colors on porcelain, and as a soap. It occurs native in certain mineral\n   springs, and is made from the boric acid of hot springs in Tuscany. It\n   was originally obtained from a lake in Thibet, and was sent to Europe\n   under the name of tincal. Borax is a pyroborate or tetraborate of\n   sodium, Na2B4O7.10H2O.'),
(8925, 'Bordage', 'n.', 'The base or servile tenure by which a bordar held his\n   cottage.'),
(8926, 'Bordar', 'n.', 'A villein who rendered menial service for his cottage; a\n   cottier.'),
(8927, 'Bordeaux', 'a.', 'Pertaining to Bordeaux in the south of France.'),
(8928, 'Bordeaux', 'n.', 'A claret wine from Bordeaux.'),
(8929, 'Bordel', 'n.', 'Alt. of Bordello'),
(8930, 'Bordello', 'n.', 'A brothel; a bawdyhouse; a house devoted to prostitution.'),
(8931, 'Border', 'n.', 'The outer part or edge of anything, as of a garment, a\n   garden, etc.; margin; verge; brink.'),
(8932, 'Border', 'n.', 'A boundary; a frontier of a state or of the settled part of\n   a country; a frontier district.'),
(8933, 'Border', 'n.', 'A strip or stripe arranged along or near the edge of\n   something, as an ornament or finish.'),
(8934, 'Border', 'n.', 'A narrow flower bed.'),
(8935, 'Bordered', 'imp. & p. p.', 'of Border'),
(8936, 'Border', 'v. i.', 'To touch at the edge or boundary; to be contiguous or\n   adjacent; -- with on or upon as, Connecticut borders on Massachusetts.'),
(8937, 'Border', 'v. i.', 'To approach; to come near to; to verge.'),
(8938, 'Border', 'v. t.', 'To make a border for; to furnish with a border, as for\n   ornament; as, to border a garment or a garden.'),
(8939, 'Border', 'v. t.', 'To be, or to have, contiguous to; to touch, or be\n   touched, as by a border; to be, or to have, near the limits or\n   boundary; as, the region borders a forest, or is bordered on the north\n   by a forest.'),
(8940, 'Border', 'v. t.', 'To confine within bounds; to limit.'),
(8941, 'Borderer', 'n.', 'One who dwells on a border, or at the extreme part or\n   confines of a country, region, or tract of land; one who dwells near to\n   a place or region.'),
(8942, 'Bordland', 'n.', 'Either land held by a bordar, or the land which a lord\n   kept for the maintenance of his board, or table.'),
(8943, 'Bordlode', 'n.', 'The service formerly required of a tenant, to carry\n   timber from the woods to the lord\'s house.'),
(8944, 'Bordman', 'n.', 'A bordar; a tenant in bordage.'),
(8945, 'Bordrag', 'n.', 'Alt. of Bordraging'),
(8946, 'Bordure', 'n.', 'A border one fifth the width of the shield, surrounding\n   the field. It is usually plain, but may be charged.'),
(8947, 'Bored', 'imp. & p. p.', 'of Bore'),
(8948, 'Boring', 'p. pr. & vb. n.', 'of Bore'),
(8949, 'Boreal', 'a.', 'Northern; pertaining to the north, or to the north wind;\n   as, a boreal bird; a boreal blast.'),
(8950, 'Boreas', 'n.', 'The north wind; -- usually a personification.'),
(8951, 'Borecole', 'n.', 'A brassicaceous plant of many varieties, cultivated for\n   its leaves, which are not formed into a compact head like the cabbage,\n   but are loose, and are generally curled or wrinkled; kale.'),
(8952, 'Boredom', 'n.', 'The state of being bored, or pestered; a state of ennui.'),
(8953, 'Boredom', 'n.', 'The realm of bores; bores, collectively.'),
(8954, 'Boree', 'n.', 'Same as BourrEe.'),
(8955, 'Borel', 'n.', 'See Borrel.'),
(8956, 'Borele', 'n.', 'The smaller two-horned rhinoceros of South Africa (Atelodus\n   bicornis).'),
(8957, 'Borer', 'n.', 'One that bores; an instrument for boring.'),
(8958, 'Borer', 'n.', 'A marine, bivalve mollusk, of the genus Teredo and allies,\n   which burrows in wood. See Teredo.'),
(8959, 'Borer', 'n.', 'Any bivalve mollusk (Saxicava, Lithodomus, etc.) which bores\n   into limestone and similar substances.'),
(8960, 'Borer', 'n.', 'One of the larvae of many species of insects, which\n   penetrate trees, as the apple, peach, pine, etc. See Apple borer, under\n   Apple.'),
(8961, 'Borer', 'n.', 'The hagfish (Myxine).'),
(8962, 'Boric', 'a.', 'Of, pertaining to, or containing, boron.'),
(8963, 'Boride', 'n.', 'A binary compound of boron with a more positive or basic\n   element or radical; -- formerly called boruret.'),
(8964, 'Boring', 'n.', 'The act or process of one who, or that which, bores; as,\n   the boring of cannon; the boring of piles and ship timbers by certain\n   marine mollusks.'),
(8965, 'Boring', 'n.', 'A hole made by boring.'),
(8966, 'Boring', 'n.', 'The chips or fragments made by boring.'),
(8967, 'Borne', 'p. p.', 'Carried; conveyed; supported; defrayed. See Bear, v. t.'),
(8968, 'Borneol', 'n.', 'A rare variety of camphor, C10H17.OH, resembling ordinary\n   camphor, from which it can be produced by reduction. It is said to\n   occur in the camphor tree of Borneo and Sumatra (Dryobalanops\n   camphora), but the natural borneol is rarely found in European or\n   American commerce, being in great request by the Chinese. Called also\n   Borneo camphor, Malay camphor, and camphol.'),
(8969, 'Bornite', 'n.', 'A valuable ore of copper, containing copper, iron, and\n   sulphur; -- also called purple copper ore (or erubescite), in allusion\n   to the colors shown upon the slightly tarnished surface.'),
(8970, 'Boron', 'n.', 'A nonmetallic element occurring abundantly in borax. It is\n   reduced with difficulty to the free state, when it can be obtained in\n   several different forms; viz., as a substance of a deep olive color, in\n   a semimetallic form, and in colorless quadratic crystals similar to the\n   diamond in hardness and other properties. It occurs in nature also in\n   boracite, datolite, tourmaline, and some other minerals. Atomic weight\n   10.9. Symbol B.'),
(8971, 'Borough', 'n.', 'In England, an incorporated town that is not a city; also,\n   a town that sends members to parliament; in Scotland, a body corporate,\n   consisting of the inhabitants of a certain district, erected by the\n   sovereign, with a certain jurisdiction; in America, an incorporated\n   town or village, as in Pennsylvania and Connecticut.'),
(8972, 'Borough', 'n.', 'The collective body of citizens or inhabitants of a\n   borough; as, the borough voted to lay a tax.'),
(8973, 'Borough', 'n.', 'An association of men who gave pledges or sureties to the\n   king for the good behavior of each other.'),
(8974, 'Borough', 'n.', 'The pledge or surety thus given.'),
(8975, 'Borracho', 'n.', 'See Borachio.'),
(8976, 'Borrage', 'a.', 'Alt. of Borraginaceous'),
(8977, 'Borrel', 'n.', 'Coarse woolen cloth; hence, coarse clothing; a garment.'),
(8978, 'Borrel', 'n.', 'A kind of light stuff, of silk and wool.'),
(8979, 'Borrel', 'n.', 'Ignorant, unlearned; belonging to the laity.'),
(8980, 'Borrowed', 'imp. & p. p.', 'of Borrow'),
(8981, 'Borrow', 'v. t.', 'To receive from another as a loan, with the implied or\n   expressed intention of returning the identical article or its\n   equivalent in kind; -- the opposite of lend.'),
(8982, 'Borrow', 'v. t.', 'To take (one or more) from the next higher denomination\n   in order to add it to the next lower; -- a term of subtraction when the\n   figure of the subtrahend is larger than the corresponding one of the\n   minuend.'),
(8983, 'Borrow', 'v. t.', 'To copy or imitate; to adopt; as, to borrow the style,\n   manner, or opinions of another.'),
(8984, 'Borrow', 'v. t.', 'To feign or counterfeit.'),
(8985, 'Borrow', 'v. t.', 'To receive; to take; to derive.'),
(8986, 'Borrow', 'n.', 'Something deposited as security; a pledge; a surety; a\n   hostage.'),
(8987, 'Borrow', 'n.', 'The act of borrowing.'),
(8988, 'Borrower', 'n.', 'One who borrows.'),
(8989, 'Boruret', 'n.', 'A boride.'),
(8990, 'Borwe', 'n.', 'Pledge; borrow.'),
(8991, 'Boscage', 'n.', 'A growth of trees or shrubs; underwood; a thicket; thick\n   foliage; a wooded landscape.'),
(8992, 'Boscage', 'n.', 'Food or sustenance for cattle, obtained from bushes and\n   trees; also, a tax on wood.'),
(8993, 'Boshes', 'pl. ', 'of Bosh'),
(8994, 'Boshbok', 'n.', 'A kind of antelope. See Bush buck.'),
(8995, 'Boshvark', 'n.', 'The bush hog. See under Bush, a thicket.'),
(8996, 'Boskage', 'n.', 'Same as Boscage.'),
(8997, 'Bosket', 'n.', 'Alt. of Bosquet'),
(8998, 'Bosquet', 'n.', 'A grove; a thicket; shrubbery; an inclosure formed by\n   branches of trees, regularly or irregularly disposed.'),
(8999, 'Bosky', 'a.', 'Woody or bushy; covered with boscage or thickets.'),
(9000, 'Bosky', 'a.', 'Caused by boscage.'),
(9001, 'Bosom', 'n.', 'The breast of a human being; the part, between the arms, to\n   which anything is pressed when embraced by them.'),
(9002, 'Bosom', 'n.', 'The breast, considered as the seat of the passions,\n   affections, and operations of the mind; consciousness; secret thoughts.'),
(9003, 'Bosom', 'n.', 'Embrace; loving or affectionate inclosure; fold.'),
(9004, 'Bosom', 'n.', 'Any thing or place resembling the breast; a supporting\n   surface; an inner recess; the interior; as, the bosom of the earth.'),
(9005, 'Bosom', 'n.', 'The part of the dress worn upon the breast; an article, or a\n   portion of an article, of dress to be worn upon the breast; as, the\n   bosom of a shirt; a linen bosom.'),
(9006, 'Bosom', 'n.', 'Inclination; desire.'),
(9007, 'Bosom', 'n.', 'A depression round the eye of a millstone.'),
(9008, 'Bosom', 'a.', 'Of or pertaining to the bosom.'),
(9009, 'Bosom', 'a.', 'Intimate; confidential; familiar; trusted; cherished;\n   beloved; as, a bosom friend.'),
(9010, 'Bosomed', 'imp. & p. p.', 'of Bosom'),
(9011, 'Bosoming', 'p. pr. & vb. n.', 'of Bosom'),
(9012, 'Bosom', 'v. t.', 'To inclose or carry in the bosom; to keep with care; to\n   take to heart; to cherish.'),
(9013, 'Bosom', 'v. t.', 'To conceal; to hide from view; to embosom.'),
(9014, 'Bosomed', 'a.', 'Having, or resembling, bosom; kept in the bosom; hidden.'),
(9015, 'Bosomy', 'a.', 'Characterized by recesses or sheltered hollows.'),
(9016, 'Boson', 'n.', 'See Boatswain.'),
(9017, 'Bosporus', 'n.', 'A strait or narrow sea between two seas, or a lake and a\n   seas; as, the Bosporus (formerly the Thracian Bosporus) or Strait of\n   Constantinople, between the Black Sea and Sea of Marmora; the Cimmerian\n   Bosporus, between the Black Sea and Sea of Azof.'),
(9018, 'Bosquet', 'n.', 'See Bosket.'),
(9019, 'Bosses', 'pl. ', 'of Boss'),
(9020, 'Bossed', 'imp. & p. p.', 'of Boss'),
(9021, 'Bossing', 'p. pr. & vb. n.', 'of Boss'),
(9022, 'Bossage', 'n.', 'A stone in a building, left rough and projecting, to be\n   afterward carved into shape.'),
(9023, 'Bossage', 'n.', 'Rustic work, consisting of stones which seem to advance\n   beyond the level of the building, by reason of indentures or channels\n   left in the joinings.'),
(9024, 'Bossed', 'a.', 'Embossed; also, bossy.'),
(9025, 'Bosset', 'n.', 'A rudimental antler of a young male of the red deer.'),
(9026, 'Bossism', 'n.', 'The rule or practices of bosses, esp. political bosses.'),
(9027, 'Bossy', 'a.', 'Ornamented with bosses; studded.'),
(9028, 'Bossy', 'n.', 'A cow or calf; -- familiarly so called.'),
(9029, 'Boston', 'n.', 'A game at cards, played by four persons, with two packs of\n   fifty-two cards each; -- said to be so called from Boston,\n   Massachusetts, and to have been invented by officers of the French army\n   in America during the Revolutionary war.'),
(9030, 'Botanic', 'a.', 'Alt. of Botanical'),
(9031, 'Botanist', 'n.', 'One skilled in botany; one versed in the knowledge of\n   plants.'),
(9032, 'Botanize', 'v. i.', 'To seek after plants for botanical investigation; to\n   study plants.'),
(9033, 'Botanize', 'v. t.', 'To explore for botanical purposes.'),
(9034, 'Botanies', 'pl. ', 'of Botany'),
(9035, 'Botany', 'a. & n.', 'The science which treats of the structure of plants,\n   the functions of their parts, their places of growth, their\n   classification, and the terms which are employed in their description\n   and denomination. See Plant.'),
(9036, 'Botany', 'a. & n.', 'A book which treats of the science of botany.'),
(9037, 'Botargo', 'n.', 'A sort of cake or sausage, made of the salted roes of the\n   mullet, much used on the coast of the Mediterranean as an incentive to\n   drink.'),
(9038, 'Botches', 'pl. ', 'of Botch'),
(9039, 'Botch', 'n.', 'A swelling on the skin; a large ulcerous affection; a boil;\n   an eruptive disease.'),
(9040, 'Botch', 'n.', 'A patch put on, or a part of a garment patched or mended in\n   a clumsy manner.'),
(9041, 'Botch', 'n.', 'Work done in a bungling manner; a clumsy performance; a\n   piece of work, or a place in work, marred in the doing, or not properly\n   finished; a bungle.'),
(9042, 'Botched', 'imp. & p. p.', 'of Botch'),
(9043, 'Botching', 'p. pr. & vb. n.', 'of Botch'),
(9044, 'Botch', 'n.', 'To mark with, or as with, botches.'),
(9045, 'Botch', 'n.', 'To repair; to mend; esp. to patch in a clumsy or imperfect\n   manner, as a garment; -- sometimes with up.'),
(9046, 'Botch', 'n.', 'To put together unsuitably or unskillfully; to express or\n   perform in a bungling manner; to spoil or mar, as by unskillful work.'),
(9047, 'Botcher', 'n.', 'One who mends or patches, esp. a tailor or cobbler.'),
(9048, 'Botcher', 'n.', 'A clumsy or careless workman; a bungler.'),
(9049, 'Botcher', 'n.', 'A young salmon; a grilse.'),
(9050, 'Botchery', 'n.', 'A botching, or that which is done by botching; clumsy or\n   careless workmanship.'),
(9051, 'Botchy', 'a.', 'Marked with botches; full of botches; poorly done.'),
(9052, 'Boteless', 'a.', 'Unavailing; in vain. See Bootless.'),
(9053, 'Botfly', 'n.', 'A dipterous insect of the family (Estridae, of many\n   different species, some of which are particularly troublesome to\n   domestic animals, as the horse, ox, and sheep, on which they deposit\n   their eggs. A common species is one of the botflies of the horse\n   (Gastrophilus equi), the larvae of which (bots) are taken into the\n   stomach of the animal, where they live several months and pass through\n   their larval states. In tropical America one species sometimes lives\n   under the human skin, and another in the stomach. See Gadfly.'),
(9054, 'Bothered', 'imp. & p. p.', 'of Bother'),
(9055, 'Bother', 'v. t.', 'To annoy; to trouble; to worry; to perplex. See Pother.'),
(9056, 'Bother', 'v. i.', 'To feel care or anxiety; to make or take trouble; to be\n   troublesome.'),
(9057, 'Bother', 'n.', 'One who, or that which, bothers; state of perplexity or\n   annoyance; embarrassment; worry; disturbance; petty trouble; as, to be\n   in a bother.'),
(9058, 'Botherer', 'n.', 'One who bothers.'),
(9059, 'Bothie', 'n.', 'Same as Bothy.'),
(9060, 'Bothnian', 'a.', 'Alt. of Bothnic'),
(9061, 'Bothnic', 'a.', 'Of or pertaining to Bothnia, a country of northern Europe,\n   or to a gulf of the same name which forms the northern part of the\n   Baltic sea.'),
(9062, 'Bothy', 'n.', 'Alt. of Boothy'),
(9063, 'Boothy', 'n.', 'A wooden hut or humble cot, esp. a rude hut or barrack for\n   unmarried farm servants; a shepherd\'s or hunter\'s hut; a booth.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(9064, 'Bo tree', '', 'The peepul tree; esp., the very ancient tree standing at\n   Anurajahpoora in Ceylon, grown from a slip of the tree under which\n   Gautama is said to have received the heavenly light and so to have\n   become Buddha.'),
(9065, 'Botryoid', 'a.', 'Alt. of Botryoidal'),
(9066, 'Botryose', 'a.', 'Having the form of a cluster of grapes.'),
(9067, 'Botryose', 'a.', 'Of the racemose or acropetal type of inflorescence.'),
(9068, 'Bottine', 'n.', 'A small boot; a lady\'s boot.'),
(9069, 'Bottine', 'n.', 'An appliance resembling a small boot furnished with\n   straps, buckles, etc., used to correct or prevent distortions in the\n   lower extremities of children.'),
