(9546, 'Brass', 'n.', 'Lumps of pyrites or sulphuret of iron, the color of which is\n   near to that of brass.'),
(9547, 'Brassage', 'n.', 'A sum formerly levied to pay the expense of coinage; --\n   now called seigniorage.'),
(9548, 'Brassart', 'n.', 'Armor for the arm; -- generally used for the whole arm\n   from the shoulder to the wrist, and consisting, in the 15th and 16th\n   centuries, of many parts.'),
(9549, 'Brasse', 'n.', 'A spotted European fish of the genus Lucioperca, resembling\n   a perch.'),
(9550, 'Brassets', 'n.', 'See Brassart.'),
(9551, 'Brassica', 'n.', 'A genus of plants embracing several species and varieties\n   differing much in appearance and qualities: such as the common cabbage\n   (B. oleracea), broccoli, cauliflowers, etc.; the wild turnip (B.\n   campestris); the common turnip (B. rapa); the rape or coleseed (B.\n   napus), etc.'),
(9552, 'Brassy', 'a.', 'Of or pertaining to brass; having the nature, appearance,\n   or hardness, of brass.'),
(9553, 'Brassy', 'a.', 'Impudent; impudently bold.'),
(9554, 'Brast', 'v. t. & i.', 'To burst.'),
(9555, 'Bratsche', 'n.', 'The tenor viola, or viola.'),
(9556, 'Brattice', 'n.', 'A wall of separation in a shaft or gallery used for\n   ventilation.'),
(9557, 'Brattice', 'n.', 'Planking to support a roof or wall.'),
(9558, 'Braunite', 'n.', 'A native oxide of manganese, of dark brownish black\n   color. It was named from a Mr. Braun of Gotha.'),
(9559, 'Bravade', 'n.', 'Bravado.'),
(9560, 'Bravado', 'n.', 'Boastful and threatening behavior; a boastful menace.'),
(9561, 'Brave', 'superl.', 'Bold; courageous; daring; intrepid; -- opposed to\n   cowardly; as, a brave man; a brave act.'),
(9562, 'Brave', 'superl.', 'Having any sort of superiority or excellence; --\n   especially such as in conspicuous.'),
(9563, 'Brave', 'superl.', 'Making a fine show or display.'),
(9564, 'Brave', 'n.', 'A brave person; one who is daring.'),
(9565, 'Brave', 'n.', 'Specifically, an Indian warrior.'),
(9566, 'Brave', 'n.', 'A man daring beyond discretion; a bully.'),
(9567, 'Brave', 'n.', 'A challenge; a defiance; bravado.'),
(9568, 'Braved', 'imp. & p. p.', 'of Brave'),
(9569, 'Braving', 'p. pr. & vb. n.', 'of Brave'),
(9570, 'Brave', 'v. t.', 'To encounter with courage and fortitude; to set at\n   defiance; to defy; to dare.'),
(9571, 'Brave', 'v. t.', 'To adorn; to make fine or showy.'),
(9572, 'Bravely', 'adv.', 'In a brave manner; courageously; gallantly; valiantly;\n   splendidly; nobly.'),
(9573, 'Bravely', 'adv.', 'Finely; gaudily; gayly; showily.'),
(9574, 'Bravely', 'adv.', 'Well; thrivingly; prosperously.'),
(9575, 'Bravery', 'n.', 'The quality of being brave; fearless; intrepidity.'),
(9576, 'Bravery', 'n.', 'The act of braving; defiance; bravado.'),
(9577, 'Bravery', 'n.', 'Splendor; magnificence; showy appearance; ostentation;\n   fine dress.'),
(9578, 'Bravery', 'n.', 'A showy person; a fine gentleman; a beau.'),
(9579, 'Braving', 'n.', 'A bravado; a boast.'),
(9580, 'Bravoes', 'pl. ', 'of Bravo'),
(9581, 'Bravo', 'a.', 'A daring villain; a bandit; one who sets law at defiance; a\n   professional assassin or murderer.'),
(9582, 'Bravo', 'interj.', 'Well done! excellent! an exclamation expressive of\n   applause.'),
(9583, 'Bravura', 'n.', 'A florid, brilliant style of music, written for effect, to\n   show the range and flexibility of a singer\'s voice, or the technical\n   force and skill of a performer; virtuoso music.'),
(9584, 'Brawled', 'imp. & p. p.', 'of Brawl'),
(9585, 'Brawling', 'p. pr. & vb. n.', 'of Brawl'),
(9586, 'Brawl', 'v. i.', 'To quarrel noisily and outrageously.'),
(9587, 'Brawl', 'v. i.', 'To complain loudly; to scold.'),
(9588, 'Brawl', 'v. i.', 'To make a loud confused noise, as the water of a rapid\n   stream running over stones.'),
(9589, 'Brawl', 'n.', 'A noisy quarrel; loud, angry contention; a wrangle; a\n   tumult; as, a drunken brawl.'),
(9590, 'Brawler', 'n.', 'One that brawls; wrangler.'),
(9591, 'Brawling', 'a.', 'Quarreling; quarrelsome; noisy.'),
(9592, 'Brawling', 'a.', 'Making a loud confused noise. See Brawl, v. i., 3.'),
(9593, 'Brawn', 'n.', 'A muscle; flesh.'),
(9594, 'Brawn', 'n.', 'Full, strong muscles, esp. of the arm or leg, muscular\n   strength; a protuberant muscular part of the body; sometimes, the arm.'),
(9595, 'Brawn', 'n.', 'The flesh of a boar; also, the salted and prepared flesh of\n   a boar.'),
(9596, 'Brawn', 'n.', 'A boar.'),
(9597, 'Brawned', 'a.', 'Brawny; strong; muscular.'),
(9598, 'Brawner', 'n.', 'A boor killed for the table.'),
(9599, 'Brawny', 'a.', 'Having large, strong muscles; muscular; fleshy; strong.'),
(9600, 'Braxy', 'n.', 'A disease of sheep. The term is variously applied in\n   different localities.'),
(9601, 'Braxy', 'n.', 'A diseased sheep, or its mutton.'),
(9602, 'Brayed', 'imp. & p. p.', 'of Bray'),
(9603, 'Braying', 'p. pr. & vb. n.', 'of Bray'),
(9604, 'Brayer', 'n.', 'An implement for braying and spreading ink in hand\n   printing.'),
(9605, 'Brayer', 'n.', 'One that brays like an ass.'),
(9606, 'Braying', 'a.', 'Making a harsh noise; blaring.'),
(9607, 'Brazed', 'imp. & p. p.', 'of Braze'),
(9608, 'Brazing', 'p. pr. & vb. n.', 'of Braze'),
(9609, 'Braze', 'v. i.', 'To solder with hard solder, esp. with an alloy of copper\n   and zinc; as, to braze the seams of a copper pipe.'),
(9610, 'Braze', 'v. i.', 'To harden.'),
(9611, 'Braze', 'v. t.', 'To cover or ornament with brass.'),
(9612, 'Brazen', 'a.', 'Pertaining to, made of, or resembling, brass.'),
(9613, 'Brazen', 'a.', 'Sounding harsh and loud, like resounding brass.'),
(9614, 'Brazen', 'a.', 'Impudent; immodest; shameless; having a front like brass;\n   as, a brazen countenance.'),
(9615, 'Brazened', 'imp. & p. p.', 'of Brazen'),
(9616, 'Brazen', 'v. t.', 'To carry through impudently or shamelessly; as, to\n   brazen the matter through.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(9617, 'Brazenly', 'adv.', 'In a bold, impudent manner.'),
(9618, 'Brazier', 'n.', 'Same as Brasier.'),
(9619, 'Brazilin', 'n.', 'A substance contained in both Brazil wood and Sapan wood,\n   from which it is extracted as a yellow crystalline substance which is\n   white when pure. It is colored intensely red by alkalies.'),
(9620, 'Breach', 'n.', 'The act of breaking, in a figurative sense.'),
(9621, 'Breach', 'n.', 'Specifically: A breaking or infraction of a law, or of any\n   obligation or tie; violation; non-fulfillment; as, a breach of\n   contract; a breach of promise.'),
(9622, 'Breach', 'n.', 'A gap or opening made made by breaking or battering, as in\n   a wall or fortification; the space between the parts of a solid body\n   rent by violence; a break; a rupture.'),
(9623, 'Breach', 'n.', 'A breaking of waters, as over a vessel; the waters\n   themselves; surge; surf.'),
(9624, 'Breach', 'n.', 'A breaking up of amicable relations; rupture.'),
(9625, 'Breach', 'n.', 'A bruise; a wound.'),
(9626, 'Breach', 'n.', 'A hernia; a rupture.'),
(9627, 'Breach', 'n.', 'A breaking out upon; an assault.'),
(9628, 'Breached', 'imp. & p. p.', 'of Breach'),
(9629, 'Breach', 'v. t.', 'To make a breach or opening in; as, to breach the walls\n   of a city.'),
(9630, 'Breach', 'v. i.', 'To break the water, as by leaping out; -- said of a\n   whale.'),
(9631, 'Breachy', 'a.', 'Apt to break fences or to break out of pasture; unruly;\n   as, breachy cattle.'),
(9632, 'Bread', 'a.', 'To spread.'),
(9633, 'Bread', 'n.', 'An article of food made from flour or meal by moistening,\n   kneading, and baking.'),
(9634, 'Bread', 'n.', 'Food; sustenance; support of life, in general.'),
(9635, 'Bread', 'v. t.', 'To cover with bread crumbs, preparatory to cooking; as,\n   breaded cutlets.'),
(9636, 'Breaded', 'a.', 'Braided'),
(9637, 'Breaden', 'a.', 'Made of bread.'),
(9638, 'Breadth', 'a.', 'Distance from side to side of any surface or thing;\n   measure across, or at right angles to the length; width.'),
(9639, 'broke', 'imp.', 'of Break'),
(9640, 'Brake', '', 'of Break'),
(9641, 'Broken', 'p. p.', 'of Break'),
(9642, 'Broke', '', 'of Break'),
(9643, 'Breaking', 'p. pr. & vb. n.', 'of Break'),
(9644, 'Break', 'v. t.', 'To strain apart; to sever by fracture; to divide with\n   violence; as, to break a rope or chain; to break a seal; to break an\n   axle; to break rocks or coal; to break a lock.'),
(9645, 'Break', 'v. t.', 'To lay open as by breaking; to divide; as, to break a\n   package of goods.'),
(9646, 'Break', 'v. t.', 'To lay open, as a purpose; to disclose, divulge, or\n   communicate.'),
(9647, 'Break', 'v. t.', 'To infringe or violate, as an obligation, law, or\n   promise.'),
(9648, 'Break', 'v. t.', 'To interrupt; to destroy the continuity of; to dissolve\n   or terminate; as, to break silence; to break one\'s sleep; to break\n   one\'s journey.'),
(9649, 'Break', 'v. t.', 'To destroy the completeness of; to remove a part from;\n   as, to break a set.'),
(9650, 'Break', 'v. t.', 'To destroy the arrangement of; to throw into disorder; to\n   pierce; as, the cavalry were not able to break the British squares.'),
(9651, 'Break', 'v. t.', 'To shatter to pieces; to reduce to fragments.'),
(9652, 'Break', 'v. t.', 'To exchange for other money or currency of smaller\n   denomination; as, to break a five dollar bill.'),
(9653, 'Break', 'v. t.', 'To destroy the strength, firmness, or consistency of; as,\n   to break flax.'),
(9654, 'Break', 'v. t.', 'To weaken or impair, as health, spirit, or mind.'),
(9655, 'Break', 'v. t.', 'To diminish the force of; to lessen the shock of, as a\n   fall or blow.'),
(9656, 'Break', 'v. t.', 'To impart, as news or information; to broach; -- with to,\n   and often with a modified word implying some reserve; as, to break the\n   news gently to the widow; to break a purpose cautiously to a friend.'),
(9657, 'Break', 'v. t.', 'To tame; to reduce to subjection; to make tractable; to\n   discipline; as, to break a horse to the harness or saddle.'),
(9658, 'Break', 'v. t.', 'To destroy the financial credit of; to make bankrupt; to\n   ruin.'),
(9659, 'Break', 'v. t.', 'To destroy the official character and standing of; to\n   cashier; to dismiss.'),
(9660, 'Break', 'v. i.', 'To come apart or divide into two or more pieces, usually\n   with suddenness and violence; to part; to burst asunder.'),
(9661, 'Break', 'v. i.', 'To open spontaneously, or by pressure from within, as a\n   bubble, a tumor, a seed vessel, a bag.'),
(9662, 'Break', 'v. i.', 'To burst forth; to make its way; to come to view; to\n   appear; to dawn.'),
(9663, 'Break', 'v. i.', 'To burst forth violently, as a storm.'),
(9664, 'Break', 'v. i.', 'To open up; to be scattered; to be dissipated; as, the\n   clouds are breaking.'),
(9665, 'Break', 'v. i.', 'To become weakened in constitution or faculties; to lose\n   health or strength.'),
(9666, 'Break', 'v. i.', 'To be crushed, or overwhelmed with sorrow or grief; as,\n   my heart is breaking.'),
(9667, 'Break', 'v. i.', 'To fall in business; to become bankrupt.'),
(9668, 'Break', 'v. i.', 'To make an abrupt or sudden change; to change the gait;\n   as, to break into a run or gallop.'),
(9669, 'Break', 'v. i.', 'To fail in musical quality; as, a singer\'s voice breaks\n   when it is strained beyond its compass and a tone or note is not\n   completed, but degenerates into an unmusical sound instead. Also, to\n   change in tone, as a boy\'s voice at puberty.'),
(9670, 'Break', 'v. i.', 'To fall out; to terminate friendship.'),
(9671, 'Break', 'v. t.', 'An opening made by fracture or disruption.'),
(9672, 'Break', 'v. t.', 'An interruption of continuity; change of direction; as, a\n   break in a wall; a break in the deck of a ship.'),
(9673, 'Break', 'v. t.', 'A projection or recess from the face of a building.'),
(9674, 'Break', 'v. t.', 'An opening or displacement in the circuit, interrupting\n   the electrical current.'),
(9675, 'Break', 'v. t.', 'An interruption; a pause; as, a break in friendship; a\n   break in the conversation.'),
(9676, 'Break', 'v. t.', 'An interruption in continuity in writing or printing, as\n   where there is an omission, an unfilled line, etc.'),
(9677, 'Break', 'v. t.', 'The first appearing, as of light in the morning; the\n   dawn; as, the break of day; the break of dawn.'),
(9678, 'Break', 'v. t.', 'A large four-wheeled carriage, having a straight body and\n   calash top, with the driver\'s seat in front and the footman\'s behind.'),
(9679, 'Break', 'v. t.', 'A device for checking motion, or for measuring friction.\n   See Brake, n. 9 & 10.'),
(9680, 'Break', 'n.', 'See Commutator.'),
(9681, 'Breakage', 'n.', 'The act of breaking; a break; a breaking; also, articles\n   broken.'),
(9682, 'Breakage', 'n.', 'An allowance or compensation for things broken\n   accidentally, as in transportation or use.'),
(9683, 'Breaker', 'n.', 'One who, or that which, breaks.'),
(9684, 'Breaker', 'n.', 'Specifically: A machine for breaking rocks, or for\n   breaking coal at the mines; also, the building in which such a machine\n   is placed.'),
(9685, 'Breaker', 'n.', 'A small water cask.'),
(9686, 'Breaker', 'n.', 'A wave breaking into foam against the shore, or against a\n   sand bank, or a rock or reef near the surface.'),
(9687, 'Breakman', 'n.', 'See Brakeman.'),
(9688, 'Break-up', 'n.', 'Disruption; a separation and dispersion of the parts or\n   members; as, a break-up of an assembly or dinner party; a break-up of\n   the government.'),
(9689, 'Bream', 'n.', 'A European fresh-water cyprinoid fish of the genus Abramis,\n   little valued as food. Several species are known.'),
(9690, 'Bream', 'n.', 'An American fresh-water fish, of various species of Pomotis\n   and allied genera, which are also called sunfishes and pondfishes. See\n   Pondfish.'),
(9691, 'Bream', 'n.', 'A marine sparoid fish of the genus Pagellus, and allied\n   genera. See Sea Bream.'),
(9692, 'Breamed', 'imp. & p. p.', 'of Bream'),
(9693, 'Breaming', 'p. pr. & vb. n.', 'of Bream'),
(9694, 'Bream', 'v. t.', 'To clean, as a ship\'s bottom of adherent shells, seaweed,\n   etc., by the application of fire and scraping.'),
(9695, 'Breast', 'n.', 'The fore part of the body, between the neck and the belly;\n   the chest; as, the breast of a man or of a horse.'),
(9696, 'Breast', 'n.', 'Either one of the protuberant glands, situated on the front\n   of the chest or thorax in the female of man and of some other mammalia,\n   in which milk is secreted for the nourishment of the young; a mamma; a\n   teat.'),
(9697, 'Breast', 'n.', 'Anything resembling the human breast, or bosom; the front\n   or forward part of anything; as, a chimney breast; a plow breast; the\n   breast of a hill.'),
(9698, 'Breast', 'n.', 'The face of a coal working.'),
(9699, 'Breast', 'n.', 'The front of a furnace.'),
(9700, 'Breast', 'n.', 'The seat of consciousness; the repository of thought and\n   self-consciousness, or of secrets; the seat of the affections and\n   passions; the heart.'),
(9701, 'Breast', 'n.', 'The power of singing; a musical voice; -- so called,\n   probably, from the connection of the voice with the lungs, which lie\n   within the breast.'),
(9702, 'Breasted', 'imp. & p. p.', 'of Breast'),
(9703, 'Breast', 'v. t.', 'To meet, with the breast; to struggle with or oppose\n   manfully; as, to breast the storm or waves.'),
(9704, 'Breasted', 'a.', 'Having a breast; -- used in composition with qualifying\n   words, in either a literal or a metaphorical sense; as, a\n   single-breasted coat.'),
(9705, 'Breath', 'n.', 'The air inhaled and exhaled in respiration; air which, in\n   the process of respiration, has parted with oxygen and has received\n   carbonic acid, aqueous vapor, warmth, etc.'),
(9706, 'Breath', 'n.', 'The act of breathing naturally or freely; the power or\n   capacity to breathe freely; as, I am out of breath.'),
(9707, 'Breath', 'n.', 'The power of respiration, and hence, life.'),
(9708, 'Breath', 'n.', 'Time to breathe; respite; pause.'),
(9709, 'Breath', 'n.', 'A single respiration, or the time of making it; a single\n   act; an instant.'),
(9710, 'Breath', 'n.', 'Fig.: That which gives or strengthens life.'),
(9711, 'Breath', 'n.', 'A single word; the slightest effort; a trifle.'),
(9712, 'Breath', 'n.', 'A very slight breeze; air in gentle motion.'),
(9713, 'Breath', 'n.', 'Fragrance; exhalation; odor; perfume.'),
(9714, 'Breath', 'n.', 'Gentle exercise, causing a quicker respiration.'),
(9715, 'Breathed', 'imp. & p. p.', 'of Breathe'),
(9716, 'Breathe', 'v. i.', 'To respire; to inhale and exhale air; hence;, to live.'),
(9717, 'Breathe', 'v. i.', 'To take breath; to rest from action.'),
(9718, 'Breathe', 'v. i.', 'To pass like breath; noiselessly or gently; to exhale;\n   to emanate; to blow gently.'),
(9719, 'Breathe', 'v. t.', 'To inhale and exhale in the process of respiration; to\n   respire.'),
(9720, 'Breathe', 'v. t.', 'To inject by breathing; to infuse; -- with into.'),
(9721, 'Breathe', 'v. t.', 'To emit or utter by the breath; to utter softly; to\n   whisper; as, to breathe a vow.'),
(9722, 'Breathe', 'v. t.', 'To exhale; to emit, as breath; as, the flowers breathe\n   odors or perfumes.'),
(9723, 'Breathe', 'v. t.', 'To express; to manifest; to give forth.'),
(9724, 'Breathe', 'v. t.', 'To act upon by the breath; to cause to sound by\n   breathing.'),
(9725, 'Breathe', 'v. t.', 'To promote free respiration in; to exercise.'),
(9726, 'Breathe', 'v. t.', 'To suffer to take breath, or recover the natural\n   breathing; to rest; as, to breathe a horse.'),
(9727, 'Breathe', 'v. t.', 'To put out of breath; to exhaust.'),
(9728, 'Breathe', 'v. t.', 'To utter without vocality, as the nonvocal consonants.'),
(9729, 'Breather', 'n.', 'One who breathes. Hence: (a) One who lives.(b) One who\n   utters. (c) One who animates or inspires.'),
(9730, 'Breather', 'n.', 'That which puts one out of breath, as violent exercise.'),
(9731, 'Breccia', 'n.', 'A rock composed of angular fragments either of the same\n   mineral or of different minerals, etc., united by a cement, and\n   commonly presenting a variety of colors.'),
(9732, 'Brede', 'n.', 'Alt. of Breede'),
(9733, 'Breede', 'n.', 'Breadth.'),
(9734, 'Brede', 'n.', 'A braid.'),
(9735, 'Breech', 'n.', 'The lower part of the body behind; the buttocks.'),
(9736, 'Breech', 'n.', 'Breeches.'),
(9737, 'Breech', 'n.', 'The hinder part of anything; esp., the part of a cannon, or\n   other firearm, behind the chamber.'),
(9738, 'Breech', 'n.', 'The external angle of knee timber, the inside of which is\n   called the throat.'),
(9739, 'Breeched', 'imp. & p. p.', 'of Breech'),
(9740, 'Breech', 'v. t.', 'To put into, or clothe with, breeches.'),
(9741, 'Breech', 'v. t.', 'To cover as with breeches.'),
(9742, 'Breech', 'v. t.', 'To fit or furnish with a breech; as, to breech a gun.'),
(9743, 'Breech', 'v. t.', 'To whip on the breech.'),
(9744, 'Breech', 'v. t.', 'To fasten with breeching.'),
(9745, 'Breeches', 'n. pl.', 'A garment worn by men, covering the hips and thighs;\n   smallclothes.'),
(9746, 'Breeches', 'n. pl.', 'Trousers; pantaloons.'),
(9747, 'Breeding', 'p. pr. & vb. n.', 'of Breed'),
(9748, 'Breed', 'v. t.', 'To produce as offspring; to bring forth; to bear; to\n   procreate; to generate; to beget; to hatch.'),
(9749, 'Breed', 'v. t.', 'To take care of in infancy, and through the age of youth;\n   to bring up; to nurse and foster.'),
(9750, 'Breed', 'v. t.', 'To educate; to instruct; to form by education; to train;\n   -- sometimes followed by up.'),
(9751, 'Breed', 'v. t.', 'To engender; to cause; to occasion; to originate; to\n   produce; as, to breed a storm; to breed disease.'),
(9752, 'Breed', 'v. t.', 'To give birth to; to be the native place of; as, a pond\n   breeds fish; a northern country breeds stout men.'),
(9753, 'Breed', 'v. t.', 'To raise, as any kind of stock.'),
(9754, 'Breed', 'v. t.', 'To produce or obtain by any natural process.'),
