(9756, 'Breed', 'v. i.', 'To be formed in the parent or dam; to be generated, or to\n   grow, as young before birth.'),
(9757, 'Breed', 'v. i.', 'To have birth; to be produced or multiplied.'),
(9758, 'Breed', 'v. i.', 'To raise a breed; to get progeny.'),
(9759, 'Breed', 'n.', 'A race or variety of men or other animals (or of plants),\n   perpetuating its special or distinctive characteristics by inheritance.'),
(9760, 'Breed', 'n.', 'Class; sort; kind; -- of men, things, or qualities.'),
(9761, 'Breed', 'n.', 'A number produced at once; a brood.'),
(9762, 'Breeder', 'n.', 'One who, or that which, breeds, produces, brings up, etc.'),
(9763, 'Breeder', 'n.', 'A cause.'),
(9764, 'Breeding', 'n.', 'The act or process of generating or bearing.'),
(9765, 'Breeding', 'n.', 'The raising or improving of any kind of domestic animals;\n   as, farmers should pay attention to breeding.'),
(9766, 'Breeding', 'n.', 'Nurture; education; formation of manners.'),
(9767, 'Breeding', 'n.', 'Deportment or behavior in the external offices and\n   decorums of social life; manners; knowledge of, or training in, the\n   ceremonies, or polite observances of society.'),
(9768, 'Breeding', 'n.', 'Descent; pedigree; extraction.'),
(9769, 'Breeze', 'n.', 'Alt. of Breeze fly'),
(9770, 'Breeze', 'n.', 'A light, gentle wind; a fresh, soft-blowing wind.'),
(9771, 'Breeze', 'n.', 'An excited or ruffed state of feeling; a flurry of\n   excitement; a disturbance; a quarrel; as, the discovery produced a\n   breeze.'),
(9772, 'Breeze', 'n.', 'Refuse left in the process of making coke or burning\n   charcoal.'),
(9773, 'Breeze', 'n.', 'Refuse coal, coal ashes, and cinders, used in the burning\n   of bricks.'),
(9774, 'Breeze', 'v. i.', 'To blow gently.'),
(9775, 'Breezy', 'a.', 'Characterized by, or having, breezes; airy.'),
(9776, 'Breezy', 'a.', 'Fresh; brisk; full of life.'),
