(10038, 'Broad', 'superl.', 'Characterized by breadth. See Breadth.'),
(10039, 'Broad', 'superl.', 'Cross; coarse; indelicate; as, a broad compliment; a\n   broad joke; broad humor.'),
(10040, 'Broad', 'superl.', 'Strongly marked; as, a broad Scotch accent.'),
(10041, 'Broad', 'n.', 'The broad part of anything; as, the broad of an oar.'),
(10042, 'Broad', 'n.', 'The spread of a river into a sheet of water; a flooded fen.'),
(10043, 'Broad', 'n.', 'A lathe tool for turning down the insides and bottoms of\n   cylinders.'),
(10044, 'Broaden', 'a.', 'To grow broad; to become broader or wider.'),
(10045, 'Broaden', 'v. t.', 'To make broad or broader; to render more broad or\n   comprehensive.'),
(10046, 'Broadish', 'a.', 'Rather broad; moderately broad.'),
(10047, 'Broadly', 'adv.', 'In a broad manner.'),
(10048, 'Brocade', 'n.', 'Silk stuff, woven with gold and silver threads, or\n   ornamented with raised flowers, foliage, etc.; -- also applied to other\n   stuffs thus wrought and enriched.'),
(10049, 'Brocaded', 'a.', 'Woven or worked, as brocade, with gold and silver, or\n   with raised flowers, etc.'),
(10050, 'Brocaded', 'a.', 'Dressed in brocade.'),
(10051, 'Brocage', 'n.', 'See Brokkerage.'),
(10052, 'Brocard', 'n.', 'An elementary principle or maximum; a short, proverbial\n   rule, in law, ethics, or metaphysics.'),
(10053, 'Brocatel', 'n.', 'A kind of coarse brocade, or figured fabric, used chiefly\n   for tapestry, linings for carriages, etc.'),
(10054, 'Brocatel', 'n.', 'A marble, clouded and veined with white, gray, yellow,\n   and red, in which the yellow usually prevails. It is also called Siena\n   marble, from its locality.'),
(10055, 'Broccoli', 'n.', 'A plant of the Cabbage species (Brassica oleracea) of\n   many varieties, resembling the cauliflower. The \"curd,\" or flowering\n   head, is the part used for food.'),
(10056, 'Broche', 'a.', 'Woven with a figure; as, broche goods.'),
(10057, 'Broche', 'n.', 'See Broach, n.'),
(10058, 'Brochure', 'v. t.', 'A printed and stitched book containing only a few\n   leaves; a pamphlet.'),
(10059, 'Brock', 'n.', 'A badger.'),
(10060, 'Brock', 'n.', 'A brocket.'),
(10061, 'Brocket', 'n.', 'A male red deer two years old; -- sometimes called brock.'),
(10062, 'Brocket', 'n.', 'A small South American deer, of several species (Coassus\n   superciliaris, C. rufus, and C. auritus).'),
(10063, 'Brockish', 'a.', 'Beastly; brutal.'),
(10064, 'Brodekin', 'n.', 'A buskin or half-boot.'),
(10065, 'Brogan', 'n.', 'A stout, coarse shoe; a brogue.'),
(10066, 'Broggle', 'n.', 'To sniggle, or fish with a brog.'),
(10067, 'Brogue', 'n.', 'A stout, coarse shoe; a brogan.'),
(10068, 'Brogue', 'v. t.', 'A dialectic pronunciation; esp. the Irish manner of\n   pronouncing English.'),
(10069, 'Brogues', 'n. pl.', 'Breeches.'),
(10070, 'Broid', 'v. t.', 'To braid.'),
(10071, 'Broider', 'v. t.', 'To embroider.'),
(10072, 'Broidery', 'n.', 'Embroidery.'),
(10073, 'Broil', 'n.', 'A tumult; a noisy quarrel; a disturbance; a brawl;\n   contention; discord, either between individuals or in the state.'),
(10074, 'Broiled', 'imp. & p. p.', 'of Broil'),
(10075, 'Broiling', 'p. pr. & vb. n.', 'of Broil'),
(10076, 'Broil', 'v. t.', 'To cook by direct exposure to heat over a fire, esp. upon\n   a gridiron over coals.'),
(10077, 'Broil', 'v. t.', 'To subject to great (commonly direct) heat.'),
(10078, 'Broil', 'v. i.', 'To be subjected to the action of heat, as meat over the\n   fire; to be greatly heated, or to be made uncomfortable with heat.'),
(10079, 'Broiler', 'n.', 'One who excites broils; one who engages in or promotes\n   noisy quarrels.'),
(10080, 'Broiler', 'n.', 'One who broils, or cooks by broiling.'),
(10081, 'Broiler', 'n.', 'A gridiron or other utensil used in broiling.'),
(10082, 'Broiler', 'n.', 'A chicken or other bird fit for broiling.'),
(10083, 'Broiling', 'a.', 'Excessively hot; as, a broiling sun.'),
(10084, 'Broiling', 'n.', 'The act of causing anything to broil.'),
(10085, 'Brokage', 'n.', 'See Brokerage.'),
(10086, 'Broke', 'v. i.', 'To transact business for another.'),
(10087, 'Broke', 'v. i.', 'To act as procurer in love matters; to pimp.'),
(10088, 'Broke', '', 'imp. & p. p. of Break.'),
(10089, 'Broken', 'v. t.', 'Separated into parts or pieces by violence; divided into\n   fragments; as, a broken chain or rope; a broken dish.'),
(10090, 'Broken', 'v. t.', 'Disconnected; not continuous; also, rough; uneven; as, a\n   broken surface.'),
(10091, 'Broken', 'v. t.', 'Fractured; cracked; disunited; sundered; strained;\n   apart; as, a broken reed; broken friendship.'),
(10092, 'Broken', 'v. t.', 'Made infirm or weak, by disease, age, or hardships.'),
(10093, 'Broken', 'v. t.', 'Subdued; humbled; contrite.'),
(10094, 'Broken', 'v. t.', 'Subjugated; trained for use, as a horse.'),
(10095, 'Broken', 'v. t.', 'Crushed and ruined as by something that destroys hope;\n   blighted.'),
(10096, 'Broken', 'v. t.', 'Not carried into effect; not adhered to; violated; as, a\n   broken promise, vow, or contract; a broken law.'),
(10097, 'Broken', 'v. t.', 'Ruined financially; incapable of redeeming promises\n   made, or of paying debts incurred; as, a broken bank; a broken\n   tradesman.'),
(10098, 'Broken', 'v. t.', 'Imperfectly spoken, as by a foreigner; as, broken\n   English; imperfectly spoken on account of emotion; as, to say a few\n   broken words at parting.'),
(10099, 'Brokenly', 'adv.', 'In a broken, interrupted manner; in a broken state; in\n   broken language.'),
(10100, 'Broker', 'v. t.', 'One who transacts business for another; an agent.'),
(10101, 'Broker', 'v. t.', 'An agent employed to effect bargains and contracts, as a\n   middleman or negotiator, between other persons, for a compensation\n   commonly called brokerage. He takes no possession, as broker, of the\n   subject matter of the negotiation. He generally contracts in the names\n   of those who employ him, and not in his own.'),
(10102, 'Broker', 'v. t.', 'A dealer in money, notes, bills of exchange, etc.'),
(10103, 'Broker', 'v. t.', 'A dealer in secondhand goods.'),
(10104, 'Broker', 'v. t.', 'A pimp or procurer.'),
(10105, 'Brokerly', 'a.', 'Mean; servile.'),
(10106, 'Brokery', 'n.', 'The business of a broker.'),
(10107, 'Broking', 'a.', 'Of or pertaining to a broker or brokers, or to brokerage.'),
(10108, 'Broma', 'n.', 'Aliment; food.'),
(10109, 'Broma', 'n.', 'A light form of prepared cocoa (or cacao), or the drink made\n   from it.'),
(10110, 'Bromal', 'n.', 'An oily, colorless fluid, CBr3.COH, related to bromoform,\n   as chloral is to chloroform, and obtained by the action of bromine on\n   alcohol.'),
(10111, 'Bromate', 'n.', 'A salt of bromic acid.'),
(10112, 'Bromate', 'v. t.', 'To combine or impregnate with bromine; as, bromated\n   camphor.'),
(10113, 'Brome', 'n.', 'See Bromine.'),
(10114, 'Bromic', 'a.', 'Of, pertaining to, or containing, bromine; -- said of those\n   compounds of bromine in which this element has a valence of five, or\n   the next to its highest; as, bromic acid.'),
(10115, 'Bromide', 'n.', 'A compound of bromine with a positive radical.'),
(10116, 'Bromine', 'n.', 'One of the elements, related in its chemical qualities to\n   chlorine and iodine. Atomic weight 79.8. Symbol Br. It is a deep\n   reddish brown liquid of a very disagreeable odor, emitting a brownish\n   vapor at the ordinary temperature. In combination it is found in minute\n   quantities in sea water, and in many saline springs. It occurs also in\n   the mineral bromyrite.'),
(10117, 'Bromism', 'n.', 'A diseased condition produced by the excessive use of\n   bromine or one of its compounds. It is characterized by mental dullness\n   and muscular weakness.'),
(10118, 'Bromize', 'v. t.', 'To prepare or treat with bromine; as, to bromize a\n   silvered plate.'),
(10119, 'Bromlife', 'n.', 'A carbonate of baryta and lime, intermediate between\n   witherite and strontianite; -- called also alstonite.'),
(10120, 'Bromuret', 'n.', 'See Bromide.'),
(10121, 'Bronchi', 'n. pl.', 'See Bronchus.'),
(10122, 'Bronchia', 'n. pl.', 'The bronchial tubes which arise from the branching of\n   the trachea, esp. the subdivision of the bronchi.'),
(10123, 'Bronchic', 'a.', 'Bronchial.'),
(10124, 'Broncho', 'n.', 'A native or a Mexican horse of small size.'),
(10125, 'Bronchi', 'pl. ', 'of Bronchus'),
(10126, 'Bronchus', 'n.', 'One of the subdivisions of the trachea or windpipe; esp.\n   one of the two primary divisions.'),
(10127, 'Bronco', 'n.', 'Same as Broncho.'),
(10128, 'Brond', 'n.', 'A sword.'),
(10129, 'Bronze', 'a.', 'An alloy of copper and tin, to which small proportions of\n   other metals, especially zinc, are sometimes added. It is hard and\n   sonorous, and is used for statues, bells, cannon, etc., the proportions\n   of the ingredients being varied to suit the particular purposes. The\n   varieties containing the higher proportions of tin are brittle, as in\n   bell metal and speculum metal.'),
(10130, 'Bronze', 'a.', 'A statue, bust, etc., cast in bronze.'),
(10131, 'Bronze', 'a.', 'A yellowish or reddish brown, the color of bronze; also, a\n   pigment or powder for imitating bronze.'),
(10132, 'Bronze', 'a.', 'Boldness; impudence; \"brass.\"'),
(10133, 'Bronzed', 'imp. & p. p.', 'of Bronze'),
(10134, 'Bronzing', 'p. pr. & vb. n.', 'of Bronze'),
(10135, 'Bronze', 'n.', 'To give an appearance of bronze to, by a coating of bronze\n   powder, or by other means; to make of the color of bronze; as, to\n   bronze plaster casts; to bronze coins or medals.'),
(10136, 'Bronze', 'n.', 'To make hard or unfeeling; to brazen.'),
(10137, 'Bronzine', 'n.', 'A metal so prepared as to have the appearance of bronze.'),
(10138, 'Bronzine', 'a.', 'Made of bronzine; resembling bronze; bronzelike.'),
(10139, 'Bronzing', 'n.', 'The act or art of communicating to articles in metal,\n   wood, clay, plaster, etc., the appearance of bronze by means of bronze\n   powders, or imitative painting, or by chemical processes.'),
(10140, 'Bronzing', 'n.', 'A material for bronzing.'),
(10141, 'Bronzist', 'n.', 'One who makes, imitates, collects, or deals in, bronzes.'),
(10142, 'Bronzite', 'n.', 'A variety of enstatite, often having a bronzelike luster.\n   It is a silicate of magnesia and iron, of the pyroxene family.'),
(10143, 'Bronzy', 'a.', 'Like bronze.'),
(10144, 'Brooch', 'n.', 'An ornament, in various forms, with a tongue, pin, or loop\n   for attaching it to a garment; now worn at the breast by women; a\n   breastpin. Formerly worn by men on the hat.'),
(10145, 'Brooch', 'n.', 'A painting all of one color, as a sepia painting, or an\n   India painting.'),
(10146, 'Brooch', 'imp. & p. p.', 'To adorn as with a brooch.'),
(10147, 'Brood', 'v. t.', 'The young birds hatched at one time; a hatch; as, a brood\n   of chickens.'),
(10148, 'Brood', 'v. t.', 'The young from the same dam, whether produced at the same\n   time or not; young children of the same mother, especially if nearly of\n   the same age; offspring; progeny; as, a woman with a brood of children.'),
(10149, 'Brood', 'v. t.', 'That which is bred or produced; breed; species.'),
(10150, 'Brood', 'v. t.', 'Heavy waste in tin and copper ores.'),
(10151, 'Brood', 'a.', 'Sitting or inclined to sit on eggs.'),
(10152, 'Brood', 'a.', 'Kept for breeding from; as, a brood mare; brood stock;\n   having young; as, a brood sow.'),
(10153, 'Brooded', 'imp. & p. p.', 'of Brood');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(10154, 'Brooding', 'p. pr. & vb. n.', 'of Brood'),
(10155, 'Brood', 'v. i.', 'To sit on and cover eggs, as a fowl, for the purpose of\n   warming them and hatching the young; or to sit over and cover young, as\n   a hen her chickens, in order to warm and protect them; hence, to sit\n   quietly, as if brooding.'),
(10156, 'Brood', 'v. i.', 'To have the mind dwell continuously or moodily on a\n   subject; to think long and anxiously; to be in a state of gloomy,\n   serious thought; -- usually followed by over or on; as, to brood over\n   misfortunes.'),
(10157, 'Brood', 'v. t.', 'To sit over, cover, and cherish; as, a hen broods her\n   chickens.'),
(10158, 'Brood', 'v. t.', 'To cherish with care.'),
(10159, 'Brood', 'v. t.', 'To think anxiously or moodily upon.'),
(10160, 'Broody', 'a.', 'Inclined to brood.'),
(10161, 'Brook', 'v. t.', 'A natural stream of water smaller than a river or creek.'),
(10162, 'Brooked', 'imp. & p. p.', 'of Brook'),
(10163, 'Brooking', 'p. pr. & vb. n.', 'of Brook'),
(10164, 'Brook', 'v. t.', 'To use; to enjoy.'),
(10165, 'Brook', 'v. t.', 'To bear; to endure; to put up with; to tolerate; as,\n   young men can not brook restraint.'),
(10166, 'Brook', 'v. t.', 'To deserve; to earn.'),
(10167, 'Brookite', 'n.', 'A mineral consisting of titanic oxide, and hence\n   identical with rutile and octahedrite in composition, but crystallizing\n   in the orthorhombic system.'),
(10168, 'Brooklet', 'n.', 'A small brook.'),
(10169, 'Broom', 'n.', 'A plant having twigs suitable for making brooms to sweep\n   with when bound together; esp., the Cytisus scoparius of Western\n   Europe, which is a low shrub with long, straight, green, angular\n   branches, minute leaves, and large yellow flowers.'),
(10170, 'Broom', 'n.', 'An implement for sweeping floors, etc., commonly made of the\n   panicles or tops of broom corn, bound together or attached to a long\n   wooden handle; -- so called because originally made of the twigs of the\n   broom.'),
(10171, 'Broom', 'v. t.', 'See Bream.'),
(10172, 'Broomy', 'a.', 'Of or pertaining to broom; overgrowing with broom;\n   resembling broom or a broom.'),
(10173, 'Brose', 'n.', 'Pottage made by pouring some boiling liquid on meal (esp.\n   oatmeal), and stirring it. It is called beef brose, water brose, etc.,\n   according to the name of the liquid (beef broth, hot water, etc.) used.'),
(10174, 'Brotel', 'a.', 'Brittle.'),
(10175, 'Broth', 'n.', 'Liquid in which flesh (and sometimes other substances, as\n   barley or rice) has been boiled; thin or simple soup.'),
(10176, 'Brothel', 'n.', 'A house of lewdness or ill fame; a house frequented by\n   prostitutes; a bawdyhouse.'),
(10177, 'Brothers', 'pl. ', 'of Brother'),
(10178, 'Brethren', 'pl. ', 'of Brother'),
(10179, 'Brothers', 'pl. ', 'of Brother'),
(10180, 'Brethren', 'pl. ', 'of Brother'),
(10181, 'Brother', 'n.', 'A male person who has the same father and mother with\n   another person, or who has one of them only. In the latter case he is\n   more definitely called a half brother, or brother of the half blood.'),
(10182, 'Brother', 'n.', 'One related or closely united to another by some common\n   tie or interest, as of rank, profession, membership in a society, toil,\n   suffering, etc.; -- used among judges, clergymen, monks, physicians,\n   lawyers, professors of religion, etc.'),
(10183, 'Brother', 'n.', 'One who, or that which, resembles another in distinctive\n   qualities or traits of character.'),
(10184, 'Brother', 'v. t.', 'To make a brother of; to call or treat as a brother; to\n   admit to a brotherhood.'),
(10185, 'Brouded', 'p.a.', 'Braided; broidered.'),
(10186, 'Brougham', 'n.', 'A light, close carriage, with seats inside for two or\n   four, and the fore wheels so arranged as to turn short.'),
(10187, 'Browbeat', 'imp.', 'of Browbeat'),
(10188, 'Browbeat', 'v. t.', 'To depress or bear down with haughty, stern looks, or\n   with arrogant speech and dogmatic assertions; to abash or disconcert by\n   impudent or abusive words or looks; to bully; as, to browbeat\n   witnesses.'),
(10189, 'Browdyng', 'n.', 'Embroidery.'),
(10190, 'Browed', 'a.', 'Having (such) a brow; -- used in composition; as,\n   dark-browed, stern-browed.'),
(10191, 'Browless', 'a.', 'Without shame.'),
(10192, 'Brown', 'superl.', 'Of a dark color, of various shades between black and\n   red or yellow.'),
(10193, 'Brown', 'n.', 'A dark color inclining to red or yellow, resulting from the\n   mixture of red and black, or of red, black, and yellow; a tawny, dusky\n   hue.'),
(10194, 'Browned', 'imp. & p. p.', 'of Brown'),
(10195, 'Browning', 'p. pr. & vb. n.', 'of Brown'),
(10196, 'Brown', 'v. t.', 'To make brown or dusky.'),
(10197, 'Brown', 'v. t.', 'To make brown by scorching slightly; as, to brown meat or\n   flour.'),
(10198, 'Brown', 'v. t.', 'To give a bright brown color to, as to gun barrels, by\n   forming a thin coat of oxide on their surface.'),
(10199, 'Brown', 'v. i.', 'To become brown.'),
(10200, 'Brownian', 'a.', 'Pertaining to Dr. Robert Brown, who first demonstrated\n   (about 1827) the commonness of the motion described below.'),
(10201, 'Brownie', 'n.', 'An imaginary good-natured spirit, who was supposed often\n   to perform important services around the house by night, such as\n   thrashing, churning, sweeping.'),
(10202, 'Browning', 'n.', 'The act or operation of giving a brown color, as to gun\n   barrels, etc.'),
(10203, 'Browning', 'n.', 'A smooth coat of brown mortar, usually the second coat,\n   and the preparation for the finishing coat of plaster.'),
(10204, 'Brownish', 'a.', 'Somewhat brown.'),
(10205, 'Brownism', 'n.', 'The views or teachings of Robert Brown of the Brownists.'),
(10206, 'Brownism', 'n.', 'The doctrines of the Brunonian system of medicine. See\n   Brunonian.'),
(10207, 'Brownist', 'n.', 'A follower of Robert Brown, of England, in the 16th\n   century, who taught that every church is complete and independent in\n   itself when organized, and consists of members meeting in one place,\n   having full power to elect and depose its officers.'),
(10208, 'Brownist', 'n.', 'One who advocates the Brunonian system of medicine.'),
(10209, 'Browny', 'a.', 'Brown or, somewhat brown.'),
(10210, 'Browpost', 'n.', 'A beam that goes across a building.'),
(10211, 'Browse', 'n.', 'The tender branches or twigs of trees and shrubs, fit for\n   the food of cattle and other animals; green food.'),
(10212, 'Browsed', 'imp. & p. p.', 'of Browse'),
(10213, 'Browsing', 'p. pr. & vb. n.', 'of Browse'),
(10214, 'Browse', 'n.', 'To eat or nibble off, as the tender branches of trees,\n   shrubs, etc.; -- said of cattle, sheep, deer, and some other animals.'),
(10215, 'Browse', 'n.', 'To feed on, as pasture; to pasture on; to graze.'),
(10216, 'Browse', 'v. i.', 'To feed on the tender branches or shoots of shrubs or\n   trees, as do cattle, sheep, and deer.'),
(10217, 'Browse', 'v. i.', 'To pasture; to feed; to nibble.'),
(10218, 'Browser', 'n.', 'An animal that browses.'),
(10219, 'Browsing', 'n.', 'Browse; also, a place abounding with shrubs where animals\n   may browse.'),
(10220, 'Browspot', 'n.', 'A rounded organ between the eyes of the frog; the\n   interocular gland.'),
(10221, 'Bruang', 'n.', 'The Malayan sun bear.'),
(10222, 'Brucine', 'n.', 'A powerful vegetable alkaloid, found, associated with\n   strychnine, in the seeds of different species of Strychnos, especially\n   in the Nux vomica. It is less powerful than strychnine. Called also\n   brucia and brucina.'),
(10223, 'Brucite', 'n.', 'A white, pearly mineral, occurring thin and foliated, like\n   talc, and also fibrous; a native magnesium hydrate.'),
(10224, 'Brucite', 'n.', 'The mineral chondrodite.'),
(10225, 'Bruin', 'a.', 'A bear; -- so called in popular tales and fables.'),
(10226, 'Bruised', 'imp. & p. p.', 'of Bruise'),
(10227, 'Bruising', 'p. pr. & vb. n.', 'of Bruise'),
(10228, 'Bruise', 'v. t.', 'To injure, as by a blow or collision, without\n   laceration; to contuse; as, to bruise one\'s finger with a hammer; to\n   bruise the bark of a tree with a stone; to bruise an apple by letting\n   it fall.'),
(10229, 'Bruise', 'v. t.', 'To break; as in a mortar; to bray, as minerals, roots,\n   etc.; to crush.'),
(10230, 'Bruise', 'v. i.', 'To fight with the fists; to box.'),
(10231, 'Bruise', 'n.', 'An injury to the flesh of animals, or to plants, fruit,\n   etc., with a blunt or heavy instrument, or by collision with some other\n   body; a contusion; as, a bruise on the head; bruises on fruit.'),
(10232, 'Bruiser', 'n.', 'One who, or that which, bruises.'),
(10233, 'Bruiser', 'n.', 'A boxer; a pugilist.'),
(10234, 'Bruiser', 'n.', 'A concave tool used in grinding lenses or the speculums of\n   telescopes.'),
(10235, 'Bruit', 'n.', 'Report; rumor; fame.'),
(10236, 'Bruit', 'n.', 'An abnormal sound of several kinds, heard on auscultation.'),
(10237, 'Bruited', 'imp. & p. p.', 'of Bruit'),
(10238, 'Bruiting', 'p. pr. & vb. n.', 'of Bruit'),
(10239, 'Bruit', 'v. t.', 'To report; to noise abroad.'),
(10240, 'Brumaire', 'n.', 'The second month of the calendar adopted by the first\n   French republic. It began thirty days after the autumnal equinox. See\n   Vendemiaire.'),
(10241, 'Brumal', 'a.', 'Of or pertaining to winter.'),
(10242, 'Brume', 'n.', 'Mist; fog; vapors.'),
(10243, 'Brumous', 'a.', 'Foggy; misty.'),
(10244, 'Brunette', 'a.', 'A girl or woman with a somewhat brown or dark complexion.'),
(10245, 'Brunette', 'a.', 'Having a dark tint.'),
(10246, 'Brunion', 'n.', 'A nectarine.'),
(10247, 'Brunt', 'v. t.', 'The heat, or utmost violence, of an onset; the strength\n   or greatest fury of any contention; as, the brunt of a battle.'),
(10248, 'Brunt', 'v. t.', 'The force of a blow; shock; collision.'),
(10249, 'Brush', 'n.', 'An instrument composed of bristles, or other like material,\n   set in a suitable back or handle, as of wood, bone, or ivory, and used\n   for various purposes, as in removing dust from clothes, laying on\n   colors, etc. Brushes have different shapes and names according to their\n   use; as, clothes brush, paint brush, tooth brush, etc.'),
(10250, 'Brush', 'n.', 'The bushy tail of a fox.'),
(10251, 'Brush', 'n.', 'A tuft of hair on the mandibles.'),
(10252, 'Brush', 'n.', 'Branches of trees lopped off; brushwood.'),
(10253, 'Brush', 'n.', 'A thicket of shrubs or small trees; the shrubs and small\n   trees in a wood; underbrush.'),
(10254, 'Brush', 'n.', 'A bundle of flexible wires or thin plates of metal, used to\n   conduct an electrical current to or from the commutator of a dynamo,\n   electric motor, or similar apparatus.'),
(10255, 'Brush', 'n.', 'The act of brushing; as, to give one\'s clothes a brush; a\n   rubbing or grazing with a quick motion; a light touch; as, we got a\n   brush from the wheel as it passed.'),
(10256, 'Brush', 'n.', 'A skirmish; a slight encounter; a shock or collision; as, to\n   have a brush with an enemy.'),
(10257, 'Brush', 'n.', 'A short contest, or trial, of speed.'),
(10258, 'Brushed', 'imp. & p. p.', 'of Brush'),
(10259, 'Brushing', 'p. pr. & vb. n.', 'of Brush'),
(10260, 'Brush', 'n.', 'To apply a brush to, according to its particular use; to\n   rub, smooth, clean, paint, etc., with a brush.'),
(10261, 'Brush', 'n.', 'To touch in passing, or to pass lightly over, as with a\n   brush.'),
(10262, 'Brush', 'n.', 'To remove or gather by brushing, or by an act like that of\n   brushing, or by passing lightly over, as wind; -- commonly with off.'),
(10263, 'Brush', 'v. i.', 'To move nimbly in haste; to move so lightly as scarcely\n   to be perceived; as, to brush by.'),
(10264, 'Brusher', 'n.', 'One who, or that which, brushes.'),
(10265, 'Brushing', 'a.', 'Constructed or used to brush with; as a brushing machine.'),
(10266, 'Brushing', 'a.', 'Brisk; light; as, a brushing gallop.'),
(10267, 'Brushite', 'n.', 'A white or gray crystalline mineral consisting of the\n   acid phosphate of calcium.'),
(10268, 'Brushy', 'a.', 'Resembling a brush; shaggy; rough.'),
(10269, 'Brusk', 'a.', 'Same as Brusque.'),
(10270, 'Brusque', 'a.', 'Rough and prompt in manner; blunt; abrupt; bluff; as, a\n   brusque man; a brusque style.'),
(10271, 'Brussels', 'n.', 'A city of Belgium, giving its name to a kind of carpet, a\n   kind of lace, etc.'),
(10272, 'Brustled', 'imp. & p. p.', 'of Brustle'),
(10273, 'Brustle', 'v. i.', 'To crackle; to rustle, as a silk garment.'),
(10274, 'Brustle', 'v. i.', 'To make a show of fierceness or defiance; to bristle.'),
(10275, 'Brustle', 'n.', 'A bristle.'),
(10276, 'Bruta', 'n.', 'See Edentata.'),
(10277, 'Brutal', 'a.', 'Of or pertaining to a brute; as, brutal nature.'),
(10278, 'Brutal', 'a.', 'Like a brute; savage; cruel; inhuman; brutish; unfeeling;\n   merciless; gross; as, brutal manners.'),
(10279, 'Brutally', 'adv.', 'In a brutal manner; cruelly.'),
(10280, 'Brute', 'a.', 'Not having sensation; senseless; inanimate; unconscious;\n   without intelligence or volition; as, the brute earth; the brute powers\n   of nature.'),
(10281, 'Brute', 'a.', 'Not possessing reason, irrational; unthinking; as, a brute\n   beast; the brute creation.'),
(10282, 'Brute', 'a.', 'Of, pertaining to, or characteristic of, a brute beast.\n   Hence: Brutal; cruel; fierce; ferocious; savage; pitiless; as, brute\n   violence.'),
(10283, 'Brute', 'a.', 'Having the physical powers predominating over the mental;\n   coarse; unpolished; unintelligent.'),
(10284, 'Brute', 'a.', 'Rough; uncivilized; unfeeling.'),
(10285, 'Brute', 'n.', 'An animal destitute of human reason; any animal not human;\n   esp. a quadruped; a beast.'),
(10286, 'Brute', 'n.', 'A brutal person; a savage in heart or manners; as unfeeling\n   or coarse person.'),
(10287, 'Brute', 'v. t.', 'To report; to bruit.'),
(10288, 'Brutely', 'adv.', 'In a rude or violent manner.'),
(10289, 'Brutify', 'v. t.', 'To make like a brute; to make senseless, stupid, or\n   unfeeling; to brutalize.'),
(10290, 'Brutish', 'a.', 'Pertaining to, or resembling, a brute or brutes; of a\n   cruel, gross, and stupid nature; coarse; unfeeling; unintelligent.'),
(10291, 'Brutism', 'n.', 'The nature or characteristic qualities or actions of a\n   brute; extreme stupidity, or beastly vulgarity.'),
(10292, 'Bruting', 'n.', 'Browsing.'),
(10293, 'Bryology', 'n.', 'That part of botany which relates to mosses.'),
(10294, 'Bryonin', 'n.', 'A bitter principle obtained from the root of the bryony\n   (Bryonia alba and B. dioica). It is a white, or slightly colored,\n   substance, and is emetic and cathartic.'),
(10295, 'Bryony', 'n.', 'The common name of several cucurbitaceous plants of the\n   genus Bryonia. The root of B. alba (rough or white bryony) and of B.\n   dioica is a strong, irritating cathartic.'),
(10296, 'Bryozoa', 'n. pl.', 'A class of Molluscoidea, including minute animals\n   which by budding form compound colonies; -- called also Polyzoa.'),
(10297, 'Bryozoan', 'a.', 'Of or pertaining to the Bryozoa.'),
(10298, 'Bryozoan', 'n.', 'One of the Bryozoa.'),
(10299, 'Bryozoum', 'n.', 'An individual zooid of a bryozoan coralline, of which\n   there may be two or more kinds in a single colony. The zooecia usually\n   have a wreath of tentacles around the mouth, and a well developed\n   stomach and intestinal canal; but these parts are lacking in the other\n   zooids (Avicularia, Ooecia, etc.).'),
(10300, 'Buansuah', 'n.', 'The wild dog of northern India (Cuon primaevus), supposed\n   by some to be an ancestral species of the domestic dog.'),
(10301, 'Bubale', 'n.', 'A large antelope (Alcelaphus bubalis) of Egypt and the\n   Desert of Sahara, supposed by some to be the fallow deer of the Bible.'),
(10302, 'Bubaline', 'a.', 'Resembling a buffalo.'),
(10303, 'Bubble', 'n.', 'A thin film of liquid inflated with air or gas; as, a soap\n   bubble; bubbles on the surface of a river.'),
(10304, 'Bubble', 'n.', 'A small quantity of air or gas within a liquid body; as,\n   bubbles rising in champagne or aerated waters.'),
(10305, 'Bubble', 'n.', 'A globule of air, or globular vacuum, in a transparent\n   solid; as, bubbles in window glass, or in a lens.'),
(10306, 'Bubble', 'n.', 'A small, hollow, floating bead or globe, formerly used for\n   testing the strength of spirits.'),
(10307, 'Bubble', 'n.', 'The globule of air in the spirit tube of a level.'),
(10308, 'Bubble', 'n.', 'Anything that wants firmness or solidity; that which is\n   more specious than real; a false show; a cheat or fraud; a delusive\n   scheme; an empty project; a dishonest speculation; as, the South Sea\n   bubble.'),
(10309, 'Bubble', 'n.', 'A person deceived by an empty project; a gull.'),
(10310, 'Bubbled', 'imp. & p. p.', 'of Bubble'),
(10311, 'Bubbling', 'p. pr. & vb. n.', 'of Bubble'),
(10312, 'Bubble', 'n.', 'To rise in bubbles, as liquids when boiling or agitated; to\n   contain bubbles.'),
(10313, 'Bubble', 'n.', 'To run with a gurgling noise, as if forming bubbles; as, a\n   bubbling stream.'),
(10314, 'Bubble', 'n.', 'To sing with a gurgling or warbling sound.'),
(10315, 'Bubbler', 'v. t.', 'To cheat; to deceive.'),
(10316, 'Bubbler', 'n.', 'One who cheats.'),
(10317, 'Bubbler', 'n.', 'A fish of the Ohio river; -- so called from the noise it\n   makes.'),
(10318, 'Bubbly', 'a.', 'Abounding in bubbles; bubbling.'),
(10319, 'Bubby', 'n.', 'A woman\'s breast.'),
(10320, 'Bubby', 'n.', 'Bub; -- a term of familiar or affectionate address to a\n   small boy.'),
(10321, 'Buboes', 'pl. ', 'of Bubo'),
(10322, 'Bubonic', 'a.', 'Of or pertaining to a bubo or buboes; characterized by\n   buboes.'),
(10323, 'Bubukle', 'n.', 'A red pimple.'),
(10324, 'Buccal', 'a.', 'Of or pertaining to the mouth or cheeks.'),
(10325, 'Buccinal', 'a.', 'Shaped or sounding like a trumpet; trumpetlike.'),
(10326, 'Buccinum', 'n.', 'A genus of large univalve mollusks abundant in the arctic\n   seas. It includes the common whelk (B. undatum).'),
(10327, 'Buceros', 'n.', 'A genus of large perching birds; the hornbills.'),
(10328, 'Buchu', 'n.', 'A South African shrub (Barosma) with small leaves that are\n   dotted with oil glands; also, the leaves themselves, which are used in\n   medicine for diseases of the urinary organs, etc. Several species\n   furnish the leaves.'),
(10329, 'Bucked', 'imp. & p. p.', 'of Buck'),
(10330, 'Bucking', 'p. pr. & vb. n.', 'of Buck'),
(10331, 'Bucker', 'n.', 'One who bucks ore.'),
(10332, 'Bucker', 'n.', 'A broad-headed hammer used in bucking ore.'),
(10333, 'Bucker', 'n.', 'A horse or mule that bucks.'),
(10334, 'Bucket', 'n.', 'A vessel for drawing up water from a well, or for catching,\n   holding, or carrying water, sap, or other liquids.'),
(10335, 'Bucket', 'n.', 'A vessel (as a tub or scoop) for hoisting and conveying\n   coal, ore, grain, etc.'),
(10336, 'Bucket', 'n.', 'One of the receptacles on the rim of a water wheel into\n   which the water rushes, causing the wheel to revolve; also, a float of\n   a paddle wheel.'),
(10337, 'Bucket', 'n.', 'The valved piston of a lifting pump.'),
(10338, 'Buckety', 'n.', 'Paste used by weavers to dress their webs.'),
(10339, 'Buckeye', 'n.', 'A name given to several American trees and shrubs of the\n   same genus (Aesculus) as the horse chestnut.'),
(10340, 'Buckeye', 'n.', 'A cant name for a native in Ohio.'),
(10341, 'Buckie', 'n.', 'A large spiral marine shell, esp. the common whelk. See\n   Buccinum.'),
(10342, 'Bucking', 'n.', 'The act or process of soaking or boiling cloth in an\n   alkaline liquid in the operation of bleaching; also, the liquid used.'),
(10343, 'Bucking', 'n.', 'A washing.'),
(10344, 'Bucking', 'n.', 'The process of breaking up or pulverizing ores.'),
(10345, 'Buckish', 'a.', 'Dandified; foppish.'),
(10346, 'Buckle', 'n.', 'A device, usually of metal, consisting of a frame with one\n   more movable tongues or catches, used for fastening things together, as\n   parts of dress or harness, by means of a strap passing through the\n   frame and pierced by the tongue.'),
(10347, 'Buckle', 'n.', 'A distortion bulge, bend, or kink, as in a saw blade or a\n   plate of sheet metal.'),
(10348, 'Buckle', 'n.', 'A curl of hair, esp. a kind of crisp curl formerly worn;\n   also, the state of being curled.'),
(10349, 'Buckle', 'n.', 'A contorted expression, as of the face.'),
(10350, 'Buckled', 'imp. & p. p.', 'of Buckle'),
(10351, 'Buckling', 'p. pr. & vb. n.', 'of Buckle'),
(10352, 'Buckle', 'n.', 'To fasten or confine with a buckle or buckles; as, to\n   buckle a harness.'),
(10353, 'Buckle', 'n.', 'To bend; to cause to kink, or to become distorted.'),
(10354, 'Buckle', 'n.', 'To prepare for action; to apply with vigor and earnestness;\n   -- generally used reflexively.'),
(10355, 'Buckle', 'n.', 'To join in marriage.'),
(10356, 'Buckle', 'v. i.', 'To bend permanently; to become distorted; to bow; to\n   curl; to kink.'),
(10357, 'Buckle', 'v. i.', 'To bend out of a true vertical plane, as a wall.'),
(10358, 'Buckle', 'v. i.', 'To yield; to give way; to cease opposing.'),
(10359, 'Buckle', 'v. i.', 'To enter upon some labor or contest; to join in close\n   fight; to struggle; to contend.'),
(10360, 'Buckler', 'n.', 'A kind of shield, of various shapes and sizes, worn on one\n   of the arms (usually the left) for protecting the front of the body.'),
(10361, 'Buckler', 'n.', 'One of the large, bony, external plates found on many\n   ganoid fishes.'),
(10362, 'Buckler', 'n.', 'The anterior segment of the shell of trilobites.'),
(10363, 'Buckler', 'n.', 'A block of wood or plate of iron made to fit a hawse hole,\n   or the circular opening in a half-port, to prevent water from entering\n   when the vessel pitches.'),
(10364, 'Buckler', 'v. t.', 'To shield; to defend.'),
(10365, 'Buckling', 'a.', 'Wavy; curling, as hair.'),
(10366, 'Buckra', 'n.', 'A white man; -- a term used by negroes of the African\n   coast, West Indies, etc.'),
(10367, 'Buckra', 'a.', 'White; white man\'s; strong; good; as, buckra yam, a white\n   yam.'),
(10368, 'Buckram', 'n.', 'A coarse cloth of linen or hemp, stiffened with size or\n   glue, used in garments to keep them in the form intended, and for\n   wrappers to cover merchandise.'),
(10369, 'Buckram', 'n.', 'A plant. See Ramson.'),
(10370, 'Buckram', 'a.', 'Made of buckram; as, a buckram suit.'),
(10371, 'Buckram', 'a.', 'Stiff; precise.'),
(10372, 'Buckram', 'v. t.', 'To strengthen with buckram; to make stiff.'),
(10373, 'Buckshot', 'n.', 'A coarse leaden shot, larger than swan shot, used in\n   hunting deer and large game.'),
(10374, 'Buckskin', 'n.', 'The skin of a buck.'),
(10375, 'Buckskin', 'n.', 'A soft strong leather, usually yellowish or grayish in\n   color, made of deerskin.'),
(10376, 'Buckskin', 'n.', 'A person clothed in buckskin, particularly an American\n   soldier of the Revolutionary war.'),
(10377, 'Buckskin', 'n.', 'Breeches made of buckskin.'),
(10378, 'Bucolic', 'a.', 'Of or pertaining to the life and occupation of a shepherd;\n   pastoral; rustic.'),
(10379, 'Bucolic', 'n.', 'A pastoral poem, representing rural affairs, and the life,\n   manners, and occupation of shepherds; as, the Bucolics of Theocritus\n   and Virgil.'),
(10380, 'Bucrania', 'pl. ', 'of Bucranium'),
(10381, 'Budded', 'imp. & p. p.', 'of Bud'),
(10382, 'Budding', 'p. pr. & vb. n.', 'of Bud'),
(10383, 'Buddha', 'n.', 'The title of an incarnation of self-abnegation, virtue, and\n   wisdom, or a deified religious teacher of the Buddhists, esp. Gautama\n   Siddartha or Sakya Sinha (or Muni), the founder of Buddhism.'),
(10384, 'Buddhism', 'n.', 'The religion based upon the doctrine originally taught by\n   the Hindoo sage Gautama Siddartha, surnamed Buddha, \"the awakened or\n   enlightened,\" in the sixth century b. c., and adopted as a religion by\n   the greater part of the inhabitants of Central and Eastern Asia and the\n   Indian Islands. Buddha\'s teaching is believed to have been atheistic;\n   yet it was characterized by elevated humanity and morality. It presents\n   release from existence (a beatific enfranchisement, Nirvana) as the\n   greatest good. Buddhists believe in transmigration of souls through all\n   phases and forms of life. Their number was estimated in 1881 at\n   470,000,000.'),
(10385, 'Buddhist', 'n.', 'One who accepts the teachings of Buddhism.'),
(10386, 'Buddhist', 'a.', 'Of or pertaining to Buddha, Buddhism, or the Buddhists.'),
(10387, 'Budding', 'n.', 'The act or process of producing buds.'),
(10388, 'Budding', 'n.', 'A process of asexual reproduction, in which a new organism\n   or cell is formed by a protrusion of a portion of the animal or\n   vegetable organism, the bud thus formed sometimes remaining attached to\n   the parent stalk or cell, at other times becoming free; gemmation. See\n   Hydroidea.'),
(10389, 'Budding', 'n.', 'The act or process of ingrafting one kind of plant upon\n   another stock by inserting a bud under the bark.'),
(10390, 'Buddle', 'n.', 'An apparatus, especially an inclined trough or vat, in\n   which stamped ore is concentrated by subjecting it to the action of\n   running water so as to wash out the lighter and less valuable portions.'),
(10391, 'Buddle', 'v. i.', 'To wash ore in a buddle.'),
(10392, 'Budged', 'imp. & p. p.', 'of Budge'),
(10393, 'Budging', 'p. pr. & vb. n.', 'of Budge'),
(10394, 'Budge', 'v. i.', 'To move off; to stir; to walk away.'),
(10395, 'Budge', 'v.', 'Brisk; stirring; jocund.'),
(10396, 'Budge', 'n.', 'A kind of fur prepared from lambskin dressed with the wool\n   on; -- used formerly as an edging and ornament, esp. of scholastic\n   habits.'),
(10397, 'Budge', 'a.', 'Lined with budge; hence, scholastic.'),
(10398, 'Budge', 'a.', 'Austere or stiff, like scholastics.'),
(10399, 'Budger', 'n.', 'One who budges.'),
(10400, 'budgerow', 'n.', 'A large and commodious, but generally cumbrous and\n   sluggish boat, used for journeys on the Ganges.'),
(10401, 'Budget', 'n.', 'A bag or sack with its contents; hence, a stock or store;\n   an accumulation; as, a budget of inventions.'),
(10402, 'Budget', 'n.', 'The annual financial statement which the British chancellor\n   of the exchequer makes in the House of Commons. It comprehends a\n   general view of the finances of the country, with the proposed plan of\n   taxation for the ensuing year. The term is sometimes applied to a\n   similar statement in other countries.'),
(10403, 'Budgy', 'n.', 'Consisting of fur.'),
(10404, 'Budlet', 'n.', 'A little bud springing from a parent bud.'),
(10405, 'Buffa', 'n. fem.', 'The comic actress in an opera.'),
(10406, 'Buffa', 'a.', 'Comic, farcical.'),
(10407, 'Buffalo', 'n.', 'A species of the genus Bos or Bubalus (B. bubalus),\n   originally from India, but now found in most of the warmer countries of\n   the eastern continent. It is larger and less docile than the common ox,\n   and is fond of marshy places and rivers.'),
(10408, 'Buffalo', 'n.', 'A very large and savage species of the same genus (B.\n   Caffer) found in South Africa; -- called also Cape buffalo.'),
(10409, 'Buffalo', 'n.', 'Any species of wild ox.'),
(10410, 'Buffalo', 'n.', 'The bison of North America.'),
(10411, 'Buffalo', 'n.', 'A buffalo robe. See Buffalo robe, below.'),
(10412, 'Buffalo', 'n.', 'The buffalo fish. See Buffalo fish, below.'),
(10413, 'Buffer', 'n.', 'An elastic apparatus or fender, for deadening the jar\n   caused by the collision of bodies; as, a buffer at the end of a\n   railroad car.'),
(10414, 'Buffer', 'n.', 'A pad or cushion forming the end of a fender, which\n   receives the blow; -- sometimes called buffing apparatus.'),
(10415, 'Buffer', 'n.', 'One who polishes with a buff.'),
(10416, 'Buffer', 'n.', 'A wheel for buffing; a buff.'),
(10417, 'Buffer', 'n.', 'A good-humored, slow-witted fellow; -- usually said of an\n   elderly man.'),
(10418, 'Buffet', 'n.', 'A cupboard or set of shelves, either movable or fixed at\n   one side of a room, for the display of plate, china, etc., a sideboard.'),
(10419, 'Buffet', 'n.', 'A counter for refreshments; a restaurant at a railroad\n   station, or place of public gathering.'),
(10420, 'Buffet', 'v. i.', 'A blow with the hand; a slap on the face; a cuff.'),
(10421, 'Buffet', 'v. i.', 'A blow from any source, or that which affects like a\n   blow, as the violence of winds or waves; a stroke; an adverse action;\n   an affliction; a trial; adversity.'),
(10422, 'Buffet', 'v. i.', 'A small stool; a stool for a buffet or counter.'),
(10423, 'Buffeted', 'imp. & p. p.', 'of Buffet'),
(10424, 'Buffet', 'v. t.', 'To strike with the hand or fist; to box; to beat; to\n   cuff; to slap.'),
(10425, 'Buffet', 'v. t.', 'To affect as with blows; to strike repeatedly; to strive\n   with or contend against; as, to buffet the billows.'),
(10426, 'Buffet', 'v. t.', 'To deaden the sound of (bells) by muffling the clapper.'),
(10427, 'Buffet', 'v. i.', 'To exercise or play at boxing; to strike; to smite; to\n   strive; to contend.'),
(10428, 'Buffet', 'v. i.', 'To make one\'s way by blows or struggling.'),
(10429, 'Buffeter', 'n.', 'One who buffets; a boxer.'),
(10430, 'Buffin', 'n.', 'A sort of coarse stuff; as, buffin gowns.'),
(10431, 'Buffle', 'n.', 'The buffalo.'),
(10432, 'Buffle', 'v. i.', 'To puzzle; to be at a loss.'),
(10433, 'Buffo', 'n.masc.', 'The comic actor in an opera.'),
(10434, 'Buffoon', 'n.', 'A man who makes a practice of amusing others by low\n   tricks, antic gestures, etc.; a droll; a mimic; a harlequin; a clown; a\n   merry-andrew.'),
(10435, 'Buffoon', 'a.', 'Characteristic of, or like, a buffoon.'),
(10436, 'Buffoon', 'v. i.', 'To act the part of a buffoon.'),
(10437, 'Buffoon', 'v. t.', 'To treat with buffoonery.'),
(10438, 'Buffy', 'a.', 'Resembling, or characterized by, buff.'),
(10439, 'Bufonite', 'n.', 'An old name for a fossil consisting of the petrified\n   teeth and palatal bones of fishes belonging to the family of Pycnodonts\n   (thick teeth), whose remains occur in the oolite and chalk formations;\n   toadstone; -- so named from a notion that it was originally formed in\n   the head of a toad.'),
(10440, 'Bugaboo', 'n.', 'Alt. of Bugbear'),
(10441, 'Bugbear', 'n.', 'Something frightful, as a specter; anything imaginary that\n   causes needless fright; something used to excite needless fear; also,\n   something really dangerous, used to frighten children, etc.'),
(10442, 'Bugbane', 'n.', 'A perennial white-flowered herb of the order Ranunculaceae\n   and genus Cimiciguga; bugwort. There are several species.'),
(10443, 'Bugbear', 'n.', 'Same as Bugaboo.'),
(10444, 'Bugbear', 'a.', 'Causing needless fright.'),
(10445, 'Bugbear', 'v. t.', 'To alarm with idle phantoms.'),
(10446, 'Bugfish', 'n.', 'The menhaden.'),
(10447, 'Bugger', 'n.', 'One guilty of buggery or unnatural vice; a sodomite.'),
(10448, 'Bugger', 'n.', 'A wretch; -- sometimes used humorously or in playful\n   disparagement.'),
(10449, 'Buggery', 'n.', 'Unnatural sexual intercourse; sodomy.'),
(10450, 'Buggy', 'a.', 'Infested or abounding with bugs.'),
(10451, 'Buggies', 'pl. ', 'of Buggy'),
(10452, 'Buggy', 'n.', 'A light one horse two-wheeled vehicle.'),
(10453, 'Buggy', 'n.', 'A light, four-wheeled vehicle, usually with one seat, and\n   with or without a calash top.'),
(10454, 'Bugle', 'n.', 'A sort of wild ox; a buffalo.'),
(10455, 'Bugle', 'n.', 'A horn used by hunters.'),
(10456, 'Bugle', 'n.', 'A copper instrument of the horn quality of tone, shorter and\n   more conical that the trumpet, sometimes keyed; formerly much used in\n   military bands, very rarely in the orchestra; now superseded by the\n   cornet; -- called also the Kent bugle.'),
(10457, 'Bugle', 'n.', 'An elongated glass bead, of various colors, though commonly\n   black.'),
(10458, 'Bugle', 'a.', 'Jet black.'),
(10459, 'Bugle', 'n.', 'A plant of the genus Ajuga of the Mint family, a native of\n   the Old World.'),
(10460, 'Bugled', 'a.', 'Ornamented with bugles.'),
(10461, 'Bugler', 'n.', 'One who plays on a bugle.'),
(10462, 'Bugloss', 'n.', 'A plant of the genus Anchusa, and especially the A.\n   officinalis, sometimes called alkanet; oxtongue.'),
(10463, 'Bugwort', 'n.', 'Bugbane.'),
(10464, 'Buhlwork', 'n.', 'Decorative woodwork in which tortoise shell, yellow\n   metal, white metal, etc., are inlaid, forming scrolls, cartouches, etc.'),
(10465, 'Buhlbuhl', 'n.', 'See Bulbul.'),
(10466, 'Built', 'imp. & p. p.', 'of Build'),
(10467, 'Building', 'p. pr. & vb. n.', 'of Build'),
(10468, 'Builded', 'imp. & p. p.', 'of Build'),
(10469, 'Build', 'v. t.', 'To erect or construct, as an edifice or fabric of any\n   kind; to form by uniting materials into a regular structure; to\n   fabricate; to make; to raise.'),
(10470, 'Build', 'v. t.', 'To raise or place on a foundation; to form, establish, or\n   produce by using appropriate means.'),
(10471, 'Build', 'v. t.', 'To increase and strengthen; to increase the power and\n   stability of; to settle, or establish, and preserve; -- frequently with\n   up; as, to build up one\'s constitution.'),
(10472, 'Build', 'v. i.', 'To exercise the art, or practice the business, of\n   building.'),
(10473, 'Build', 'v. i.', 'To rest or depend, as on a foundation; to ground one\'s\n   self or one\'s hopes or opinions upon something deemed reliable; to\n   rely; as, to build on the opinions or advice of others.'),
(10474, 'Build', 'n.', 'Form or mode of construction; general figure; make; as, the\n   build of a ship.'),
(10475, 'Builder', 'n.', 'One who builds; one whose occupation is to build, as a\n   carpenter, a shipwright, or a mason.'),
(10476, 'Building', 'n.', 'The act of constructing, erecting, or establishing.'),
(10477, 'Building', 'n.', 'The art of constructing edifices, or the practice of\n   civil architecture.'),
(10478, 'Building', 'n.', 'That which is built; a fabric or edifice constructed, as\n   a house, a church, etc.'),
(10479, 'Built', 'n.', 'Shape; build; form of structure; as, the built of a ship.'),
(10480, 'Built', 'a.', 'Formed; shaped; constructed; made; -- often used in\n   composition and preceded by the word denoting the form; as,\n   frigate-built, clipper-built, etc.'),
(10481, 'Bukshish', 'n.', 'See Backsheesh.'),
(10482, 'Bulau', 'n.', 'An East Indian insectivorous mammal (Gymnura Rafflesii),\n   somewhat like a rat in appearance, but allied to the hedgehog.'),
(10483, 'Bulbar', 'a.', 'Of or pertaining to bulb; especially, in medicine,\n   pertaining to the bulb of the spinal cord, or medulla oblongata; as,\n   bulbar paralysis.'),
(10484, 'Bulbed', 'a.', 'Having a bulb; round-headed.'),
(10485, 'Bulbel', 'n.', 'A separable bulb formed on some flowering plants.'),
(10486, 'Bulblet', 'n.', 'A small bulb, either produced on a larger bulb, or on some\n   aerial part of a plant, as in the axils of leaves in the tiger lily, or\n   replacing the flowers in some kinds of onion.'),
(10487, 'Bulbose', 'a.', 'Bulbous.'),
(10488, 'Bulbous', 'n.', 'Having or containing bulbs, or a bulb; growing from bulbs;\n   bulblike in shape or structure.'),
(10489, 'Bulbul', 'n.', 'The Persian nightingale (Pycnonotus jocosus). The name is\n   also applied to several other Asiatic singing birds, of the family\n   Timaliidae. The green bulbuls belong to the Chloropsis and allied\n   genera.'),
(10490, 'Bulbule', 'n.', 'A small bulb; a bulblet.'),
(10491, 'Bulchin', 'n.', 'A little bull.'),
(10492, 'Bulge', 'n.', 'The bilge or protuberant part of a cask.'),
(10493, 'Bulge', 'n.', 'A swelling, protuberant part; a bending outward, esp. when\n   caused by pressure; as, a bulge in a wall.'),
(10494, 'Bulge', 'n.', 'The bilge of a vessel. See Bilge, 2.'),
(10495, 'Bulged', 'imp. & p. p.', 'of Bulge'),
(10496, 'Bulging', 'p. pr. & vb. n.', 'of Bulge'),
(10497, 'Bulge', 'v. i.', 'To swell or jut out; to bend outward, as a wall when it\n   yields to pressure; to be protuberant; as, the wall bulges.'),
(10498, 'Bulge', 'v. i.', 'To bilge, as a ship; to founder.'),
(10499, 'Bulgy', 'a.', 'Bulged; bulging; bending, or tending to bend, outward.'),
(10500, 'Bulimia', 'n.', 'Alt. of Bulimy'),
(10501, 'Bulimy', 'n.', 'A disease in which there is a perpetual and insatiable\n   appetite for food; a diseased and voracious appetite.'),
(10502, 'Bulimus', 'n.', 'A genus of land snails having an elongated spiral shell,\n   often of large size. The species are numerous and abundant in tropical\n   America.'),
(10503, 'Bulked', 'imp. & p. p.', 'of Bulk'),
(10504, 'Bulking', 'p. pr. & vb. n.', 'of Bulk'),
(10505, 'Bulker', 'n.', 'A person employed to ascertain the bulk or size of goods,\n   in order to fix the amount of freight or dues payable on them.'),
(10506, 'Bulkhead', 'n.', 'A partition in a vessel, to separate apartments on the\n   same deck.'),
(10507, 'Bulkhead', 'n.', 'A structure of wood or stone, to resist the pressure of\n   earth or water; a partition wall or structure, as in a mine; the\n   limiting wall along a water front.'),
(10508, 'Bulky', 'a.', 'Of great bulk or dimensions; of great size; large; thick;\n   massive; as, bulky volumes.'),
(10509, 'Bullae', 'pl. ', 'of Bulla'),
(10510, 'Bulla', 'n.', 'A bleb; a vesicle, or an elevation of the cuticle,\n   containing a transparent watery fluid.'),
(10511, 'Bulla', 'n.', 'The ovoid prominence below the opening of the ear in the\n   skulls of many animals; as, the tympanic or auditory bulla.'),
(10512, 'Bulla', 'n.', 'A leaden seal for a document; esp. the round leaden seal\n   attached to the papal bulls, which has on one side a representation of\n   St. Peter and St. Paul, and on the other the name of the pope who uses\n   it.'),
(10513, 'Bulla', 'n.', 'A genus of marine shells. See Bubble shell.'),
(10514, 'Bullace', 'n.', 'A small European plum (Prunus communis, var. insitita).\n   See Plum.'),
(10515, 'Bullace', 'n.', 'The bully tree.'),
(10516, 'Bullary', 'n.', 'A collection of papal bulls.'),
(10517, 'Bullary', 'n.', 'A place for boiling or preparing salt; a boilery.'),
(10518, 'Bullate', 'a.', 'Appearing as if blistered; inflated; puckered.'),
(10519, 'Bulldog', 'n.', 'A variety of dog, of remarkable ferocity, courage, and\n   tenacity of grip; -- so named, probably, from being formerly employed\n   in baiting bulls.'),
(10520, 'Bulldog', 'n.', 'A refractory material used as a furnace lining, obtained\n   by calcining the cinder or slag from the puddling furnace of a rolling\n   mill.'),
(10521, 'Bulldog', 'a.', 'Characteristic of, or like, a bulldog; stubborn; as,\n   bulldog courage; bulldog tenacity.'),
(10522, 'Bulldoze', 'v. t.', 'To intimidate; to restrain or coerce by intimidation\n   or violence; -- used originally of the intimidation of negro voters, in\n   Louisiana.'),
(10523, 'Bulled', 'a.', 'Swollen.'),
(10524, 'Bullet', 'n.', 'A small ball.'),
(10525, 'Bullet', 'n.', 'A missile, usually of lead, and round or elongated in form,\n   to be discharged from a rifle, musket, pistol, or other small firearm.'),
(10526, 'Bullet', 'n.', 'A cannon ball.'),
(10527, 'Bullet', 'n.', 'The fetlock of a horse.'),
(10528, 'Bulletin', 'n.', 'A brief statement of facts respecting some passing event,\n   as military operations or the health of some distinguished personage,\n   issued by authority for the information of the public.'),
(10529, 'Bulletin', 'n.', 'Any public notice or announcement, especially of news\n   recently received.'),
(10530, 'Bulletin', 'n.', 'A periodical publication, especially one containing the\n   proceeding of a society.'),
(10531, 'Bullfist', 'n.', 'Alt. of Bullfice'),
(10532, 'Bullfice', 'n.', 'A kind of fungus. See Puffball.'),
(10533, 'Bull fly', 'n.', 'Alt. of Bullfly'),
(10534, 'Bullfly', 'n.', 'Any large fly troublesome to cattle, as the gadflies and\n   breeze flies.'),
(10535, 'Bullfrog', 'n.', 'A very large species of frog (Rana Catesbiana), found in\n   North America; -- so named from its loud bellowing in spring.'),
(10536, 'Bullhead', 'n.', 'A fresh-water fish of many species, of the genus\n   Uranidea, esp. U. gobio of Europe, and U. Richardsoni of the United\n   States; -- called also miller\'s thumb.'),
(10537, 'Bullhead', 'n.', 'In America, several species of Amiurus; -- called also\n   catfish, horned pout, and bullpout.'),
(10538, 'Bullhead', 'n.', 'A marine fish of the genus Cottus; the sculpin.'),
(10539, 'Bullhead', 'n.', 'The black-bellied plover (Squatarola helvetica); --\n   called also beetlehead.'),
(10540, 'Bullhead', 'n.', 'The golden plover.'),
(10541, 'Bullhead', 'n.', 'A stupid fellow; a lubber.'),
(10542, 'Bullhead', 'n.', 'A small black water insect.'),
(10543, 'Bullion', 'n.', 'Uncoined gold or silver in the mass.'),
(10544, 'Bullion', 'n.', 'Base or uncurrent coin.'),
(10545, 'Bullion', 'n.', 'Showy metallic ornament, as of gold, silver, or copper, on\n   bridles, saddles, etc.'),
(10546, 'Bullion', 'n.', 'Heavy twisted fringe, made of fine gold or silver wire and\n   used for epaulets; also, any heavy twisted fringe whose cords are\n   prominent.'),
(10547, 'Bullirag', 'n.', 'To intimidate by bullying; to rally contemptuously; to\n   badger.'),
(10548, 'Bullish', 'a.', 'Partaking of the nature of a bull, or a blunder.'),
(10549, 'Bullist', 'n.', 'A writer or drawer up of papal bulls.'),
(10550, 'Bullock', 'n.', 'A young bull, or any male of the ox kind.'),
(10551, 'Bullock', 'n.', 'An ox, steer, or stag.'),
(10552, 'Bullock', 'v. t.', 'To bully.'),
(10553, 'Bullon', 'n.', 'A West Indian fish (Scarus Croicensis).'),
(10554, 'Bullpout', 'n.', 'See Bullhead, 1 (b).'),
(10555, 'Bullweed', 'n.', 'Knapweed.'),
(10556, 'Bullwort', 'n.', 'See Bishop\'s-weed.'),
(10557, 'Bullies', 'pl. ', 'of Bully'),
(10558, 'Bully', 'n.', 'A noisy, blustering fellow, more insolent than courageous;\n   one who is threatening and quarrelsome; an insolent, tyrannical fellow.'),
(10559, 'Bully', 'n.', 'A brisk, dashing fellow.'),
(10560, 'Bully', 'a.', 'Jovial and blustering; dashing.'),
(10561, 'Bully', 'a.', 'Fine; excellent; as, a bully horse.'),
(10562, 'Bullied', 'imp. & p. p.', 'of Bully'),
(10563, 'Bullying', 'p. pr. & vb. n.', 'of Bully'),
(10564, 'Bully', 'v. t.', 'To intimidate with threats and by an overbearing,\n   swaggering demeanor; to act the part of a bully toward.'),
(10565, 'Bully', 'v. i.', 'To act as a bully.'),
(10566, 'Bullyrag', 'v. t.', 'Same as Bullirag.'),
(10567, 'Bulrush', 'n.', 'A kind of large rush, growing in wet land or in water.'),
(10568, 'Bulse', 'n.', 'A purse or bag in which to carry or measure diamonds, etc.'),
(10569, 'Bultel', 'n.', 'A bolter or bolting cloth; also, bran.'),
(10570, 'Bulti', 'n.', 'Same as Bolty.'),
(10571, 'Bultow', 'n.', 'A trawl; a boulter; the mode of fishing with a boulter or\n   spiller.'),
(10572, 'Bulwark', 'n.', 'A rampart; a fortification; a bastion or outwork.'),
(10573, 'Bulwark', 'n.', 'That which secures against an enemy, or defends from\n   attack; any means of defense or protection.'),
(10574, 'Bulwark', 'n.', 'The sides of a ship above the upper deck.'),
(10575, 'Bulwark', 'v. t.', 'To fortify with, or as with, a rampart or wall; to\n   secure by fortification; to protect.'),
(10576, 'Bummed', 'imp. & p. p.', 'of Bum'),
(10577, 'Bumming', 'n.', 'of Bum'),
(10578, 'Bumbard', '', 'See Bombard.'),
(10579, 'Bumbarge', 'n.', 'See Bumboat.'),
(10580, 'Bumbast', '', 'See Bombast.'),
(10581, 'Bumbelo', 'n.', 'A glass used in subliming camphor.'),
(10582, 'Bumble', 'n.', 'The bittern.'),
(10583, 'Bumble', 'v. i.', 'To make a hollow or humming noise, like that of a\n   bumblebee; to cry as a bittern.'),
(10584, 'Bumboat', 'n.', 'A clumsy boat, used for conveying provisions, fruit, etc.,\n   for sale, to vessels lying in port or off shore.'),
(10585, 'Bumkin', 'n.', 'A projecting beam or boom; as: (a) One projecting from each\n   bow of a vessel, to haul the fore tack to, called a tack bumpkin. (b)\n   One from each quarter, for the main-brace blocks, and called brace\n   bumpkin. (c) A small outrigger over the stern of a boat, to extend the\n   mizzen.'),
(10586, 'Bummalo', 'n.', 'A small marine Asiatic fish (Saurus ophidon) used in India\n   as a relish; -- called also Bombay duck.'),
(10587, 'Bummer', 'n.', 'An idle, worthless fellow, who is without any visible means\n   of support; a dissipated sponger.'),
(10588, 'Bummery', 'n.', 'See Bottomery.'),
(10589, 'Bumped', 'imp. & p. p.', 'of Bump'),
(10590, 'Bumping', 'p. pr. & vb. n.', 'of Bump'),
(10591, 'Bumper', 'n.', 'A cup or glass filled to the brim, or till the liquor runs\n   over, particularly in drinking a health or toast.'),
(10592, 'Bumper', 'n.', 'A covered house at a theater, etc., in honor of some\n   favorite performer.'),
(10593, 'Bumper', 'n.', 'That which bumps or causes a bump.'),
(10594, 'Bumper', 'n.', 'Anything which resists or deadens a bump or shock; a\n   buffer.'),
(10595, 'Bumpkin', 'n.', 'An awkward, heavy country fellow; a clown; a country lout.'),
(10596, 'Bunch', 'n.', 'A protuberance; a hunch; a knob or lump; a hump.'),
(10597, 'Bunch', 'n.', 'A collection, cluster, or tuft, properly of things of the\n   same kind, growing or fastened together; as, a bunch of grapes; a bunch\n   of keys.'),
(10598, 'Bunch', 'n.', 'A small isolated mass of ore, as distinguished from a\n   continuous vein.'),
(10599, 'Bunched', 'imp. & p. p.', 'of Bunch'),
(10600, 'Bunching', 'p. pr. & vb. n.', 'of Bunch'),
(10601, 'Bunch', 'v. i.', 'To swell out into a bunch or protuberance; to be\n   protuberant or round.'),
(10602, 'Bunch', 'v. t.', 'To form into a bunch or bunches.'),
(10603, 'Bunchy', 'a.', 'Swelling out in bunches.'),
(10604, 'Bunchy', 'a.', 'Growing in bunches, or resembling a bunch; having tufts;\n   as, the bird\'s bunchy tail.'),
(10605, 'Bunchy', 'a.', 'Yielding irregularly; sometimes rich, sometimes poor; as, a\n   bunchy mine.'),
(10606, 'Buncombe', 'n.', 'Alt. of Bunkum'),
(10607, 'Bunkum', 'n.', 'Speech-making for the gratification of constituents, or to\n   gain public applause; flattering talk for a selfish purpose; anything\n   said for mere show.'),
(10608, 'Bunder', 'n.', 'A boat or raft used in the East Indies in the landing of\n   passengers and goods.'),
(10609, 'Bundle', 'n.', 'A number of things bound together, as by a cord or\n   envelope, into a mass or package convenient for handling or conveyance;\n   a loose package; a roll; as, a bundle of straw or of paper; a bundle of\n   old clothes.'),
(10610, 'Bundled', 'imp. & p. p.', 'of Bundle'),
(10611, 'Bundling', 'p. pr. & vb. n.', 'of Bundle'),
(10612, 'Bundle', 'v. t.', 'To tie or bind in a bundle or roll.'),
(10613, 'Bundle', 'v. t.', 'To send off abruptly or without ceremony.'),
(10614, 'Bundle', 'v. i.', 'To prepare for departure; to set off in a hurry or\n   without ceremony.'),
(10615, 'Bundle', 'v. i.', 'To sleep on the same bed without undressing; -- applied\n   to the custom of a man and woman, especially lovers, thus sleeping.'),
(10616, 'Bunged', 'imp. & p. p.', 'of Bung'),
(10617, 'Bunging', 'p. pr. & vb. n.', 'of Bung'),
(10618, 'Bungalow', 'n.', 'A thatched or tiled house or cottage, of a single story,\n   usually surrounded by a veranda.'),
(10619, 'Bungarum', 'n.', 'A venomous snake of India, of the genus Bungarus, allied\n   to the cobras, but without a hood.'),
(10620, 'Bunghole', 'n.', 'See Bung, n., 2.'),
(10621, 'Bungled', 'imp. & p. p.', 'of Bungle'),
(10622, 'Bungling', 'p. pr. & vb. n.', 'of Bungle'),
(10623, 'Bungle', 'v. i.', 'To act or work in a clumsy, awkward manner.'),
(10624, 'Bungle', 'v. t.', 'To make or mend clumsily; to manage awkwardly; to botch;\n   -- sometimes with up.'),
(10625, 'Bungle', 'n.', 'A clumsy or awkward performance; a botch; a gross blunder.'),
(10626, 'Bungler', 'n.', 'A clumsy, awkward workman; one who bungles.'),
(10627, 'Bungling', 'a.', 'Unskillful; awkward; clumsy; as, a bungling workman.'),
(10628, 'Bungo', 'n.', 'A kind of canoe used in Central and South America; also, a\n   kind of boat used in the Southern United States.'),
(10629, 'Bunion', 'n.', 'Same as Bunyon.'),
(10630, 'Bunked', 'imp. & p. p.', 'of Bunk'),
(10631, 'Bunking', 'p. pr. & vb. n.', 'of Bunk'),
(10632, 'Bunker', 'n.', 'A sort of chest or box, as in a window, the lid of which\n   serves for a seat.'),
(10633, 'Bunker', 'n.', 'A large bin or similar receptacle; as, a coal bunker.'),
(10634, 'Bunko', 'n.', 'A kind of swindling game or scheme, by means of cards or by\n   a sham lottery.'),
(10635, 'Bunkum', 'n.', 'See Buncombe.'),
(10636, 'Bunnian', 'n.', 'See Bunyon.'),
(10637, 'Bunny', 'n.', 'A great collection of ore without any vein coming into it or\n   going out from it.'),
(10638, 'Bunny', 'n.', 'A pet name for a rabbit or a squirrel.'),
(10639, 'Bunter', 'n.', 'A woman who picks up rags in the streets; hence, a low,\n   vulgar woman.'),
(10640, 'Bunting', 'n.', 'A bird of the genus Emberiza, or of an allied genus,\n   related to the finches and sparrows (family Fringillidae).'),
(10641, 'Bunting', 'n.', 'Alt. of Buntine'),
(10642, 'Buntine', 'n.', 'A thin woolen stuff, used chiefly for flags, colors, and\n   ships\' signals.'),
(10643, 'Buntline', 'n.', 'One of the ropes toggled to the footrope of a sail, used\n   to haul up to the yard the body of the sail when taking it in.'),
(10644, 'Bunyon', 'n.', 'Alt. of Bunion'),
(10645, 'Bunion', 'n.', 'An enlargement and inflammation of a small membranous sac\n   (one of the bursae muscosae), usually occurring on the first joint of\n   the great toe.'),
(10646, 'Buoyed', 'imp. & p. p.', 'of Buoy'),
(10647, 'Buoying', 'p. pr. & vb. n.', 'of Buoy'),
(10648, 'Buoyage', 'n.', 'Buoys, taken collectively; a series of buoys, as for the\n   guidance of vessels into or out of port; the providing of buoys.'),
(10649, 'Buoyance', 'n.', 'Buoyancy.'),
(10650, 'Buoyancy', 'n.', 'The property of floating on the surface of a liquid, or\n   in a fluid, as in the atmosphere; specific lightness, which is\n   inversely as the weight compared with that of an equal volume of water.'),
(10651, 'Buoyancy', 'n.', 'The upward pressure exerted upon a floating body by a\n   fluid, which is equal to the weight of the body; hence, also, the\n   weight of a floating body, as measured by the volume of fluid\n   displaced.'),
(10652, 'Buoyancy', 'n.', 'Cheerfulness; vivacity; liveliness; sprightliness; -- the\n   opposite of heaviness; as, buoyancy of spirits.'),
(10653, 'Buoyant', 'v. t. & i.', 'Having the quality of rising or floating in a\n   fluid; tending to rise or float; as, iron is buoyant in mercury.'),
(10654, 'Buoyant', 'v. t. & i.', 'Bearing up, as a fluid; sustaining another body by\n   being specifically heavier.'),
(10655, 'Buoyant', 'v. t. & i.', 'Light-hearted; vivacious; cheerful; as, a buoyant\n   disposition; buoyant spirits.'),
(10656, 'Burbolt', 'n.', 'A birdbolt.'),
(10657, 'Burbot', 'n.', 'A fresh-water fish of the genus Lota, having on the nose\n   two very small barbels, and a larger one on the chin.'),
(10658, 'Burden', 'n.', 'That which is borne or carried; a load.'),
(10659, 'Burden', 'n.', 'That which is borne with labor or difficulty; that which is\n   grievous, wearisome, or oppressive.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(10660, 'Burden', 'n.', 'The capacity of a vessel, or the weight of cargo that she\n   will carry; as, a ship of a hundred tons burden.'),
(10661, 'Burden', 'n.', 'The tops or heads of stream-work which lie over the stream\n   of tin.'),
(10662, 'Burden', 'n.', 'The proportion of ore and flux to fuel, in the charge of a\n   blast furnace.'),
(10663, 'Burden', 'n.', 'A fixed quantity of certain commodities; as, a burden of\n   gad steel, 120 pounds.'),
(10664, 'Burden', 'n.', 'A birth.'),
(10665, 'Burdened', 'imp. & p. p.', 'of Burden'),
(10666, 'Burden', 'v. t.', 'To encumber with weight (literal or figurative); to lay\n   a heavy load upon; to load.'),
(10667, 'Burden', 'v. t.', 'To oppress with anything grievous or trying; to\n   overload; as, to burden a nation with taxes.'),
(10668, 'Burden', 'v. t.', 'To impose, as a load or burden; to lay or place as a\n   burden (something heavy or objectionable).'),
(10669, 'Burden', 'n.', 'The verse repeated in a song, or the return of the theme at\n   the end of each stanza; the chorus; refrain. Hence: That which is often\n   repeated or which is dwelt upon; the main topic; as, the burden of a\n   prayer.'),
(10670, 'Burden', 'n.', 'The drone of a bagpipe.'),
(10671, 'Burden', 'n.', 'A club.'),
(10672, 'Burdener', 'n.', 'One who loads; an oppressor.'),
(10673, 'Burdock', 'n.', 'A genus of coarse biennial herbs (Lappa), bearing small\n   burs which adhere tenaciously to clothes, or to the fur or wool of\n   animals.'),
(10674, 'Burdon', 'n.', 'A pilgrim\'s staff.'),
(10675, 'Bureaus', 'pl. ', 'of Bureau'),
(10676, 'Bureaux', 'pl. ', 'of Bureau'),
(10677, 'Bureau', 'n.', 'Originally, a desk or writing table with drawers for\n   papers.'),
(10678, 'Bureau', 'n.', 'The place where such a bureau is used; an office where\n   business requiring writing is transacted.'),
(10679, 'Bureau', 'n.', 'Hence: A department of public business requiring a force of\n   clerks; the body of officials in a department who labor under the\n   direction of a chief.'),
(10680, 'Bureau', 'n.', 'A chest of drawers for clothes, especially when made as an\n   ornamental piece of furniture.'),
(10681, 'Burel', 'n. & a.', 'Same as Borrel.'),
(10682, 'Burette', 'n.', 'An apparatus for delivering measured quantities of liquid\n   or for measuring the quantity of liquid or gas received or discharged.\n   It consists essentially of a graduated glass tube, usually furnished\n   with a small aperture and stopcock.'),
(10683, 'Bur fish', '', 'A spinose, plectognath fish of the Allantic coast of the\n   United States (esp. Chilo mycterus geometricus) having the power of\n   distending its body with water or air, so as to resemble a chestnut\n   bur; -- called also ball fish, balloon fish, and swellfish.'),
(10684, 'Burgage', 'n.', 'A tenure by which houses or lands are held of the king or\n   other lord of a borough or city; at a certain yearly rent, or by\n   services relating to trade or handicraft.'),
(10685, 'Burgall', 'n.', 'A small marine fish; -- also called cunner.'),
(10686, 'Burgamot', 'n.', 'See Bergamot.'),
(10687, 'Burganet', 'n.', 'See Burgonet.'),
(10688, 'Burgee', 'n.', 'A kind of small coat.'),
(10689, 'Burgee', 'n.', 'A swallow-tailed flag; a distinguishing pennant, used by\n   cutters, yachts, and merchant vessels.'),
(10690, 'Burgeois', 'n.', 'See 1st Bourgeois.'),
(10691, 'Burgeois', 'n.', 'A burgess; a citizen. See 2d Bourgeois.'),
(10692, 'Burgeon', 'v. i.', 'To bud. See Bourgeon.'),
(10693, 'Burgess', 'n.', 'An inhabitant of a borough or walled town, or one who\n   possesses a tenement therein; a citizen or freeman of a borough.'),
(10694, 'Burgess', 'n.', 'One who represents a borough in Parliament.'),
(10695, 'Burgess', 'n.', 'A magistrate of a borough.'),
(10696, 'Burgess', 'n.', 'An inhabitant of a Scotch burgh qualified to vote for\n   municipal officers.'),
(10697, 'Burgh', 'n.', 'A borough or incorporated town, especially, one in Scotland.\n   See Borough.'),
(10698, 'Burghal', 'a.', 'Belonging to a burgh.'),
(10699, 'Burgher', 'n.', 'A freeman of a burgh or borough, entitled to enjoy the\n   privileges of the place; any inhabitant of a borough.'),
(10700, 'Burgher', 'n.', 'A member of that party, among the Scotch seceders, which\n   asserted the lawfulness of the burgess oath (in which burgesses profess\n   \"the true religion professed within the realm\"), the opposite party\n   being called antiburghers.'),
(10701, 'Burglar', 'n.', 'One guilty of the crime of burglary.'),
(10702, 'Burglary', 'n.', 'Breaking and entering the dwelling house of another, in\n   the nighttime, with intent to commit a felony therein, whether the\n   felonious purpose be accomplished or not.'),
(10703, 'Burgonet', 'n.', 'A kind of helmet.'),
(10704, 'Burgoo', 'n.', 'A kind of oatmeal pudding, or thick gruel, used by seamen.'),
(10705, 'Burgrass', 'n.', 'Grass of the genus Cenchrus, growing in sand, and having\n   burs for fruit.'),
(10706, 'Burgrave', 'n.', 'See Burggrave.'),
(10707, 'Burgundy', 'n.', 'An old province of France (in the eastern central part).'),
(10708, 'Burgundy', 'n.', 'A richly flavored wine, mostly red, made in Burgundy,\n   France.'),
(10709, 'Burhel', 'n.', 'Alt. of Burrhel'),
(10710, 'Burrhel', 'n.', 'The wild Himalayan, or blue, sheep (Ovis burrhel).'),
(10711, 'Burial', 'n.', 'A grave; a tomb; a place of sepulture.'),
(10712, 'Burial', 'n.', 'The act of burying; depositing a dead body in the earth, in\n   a tomb or vault, or in the water, usually with attendant ceremonies;\n   sepulture; interment.'),
(10713, 'Burier', 'n.', 'One who, or that which, buries.'),
(10714, 'Burin', 'n.', 'The cutting tool of an engraver on metal, used in line\n   engraving. It is made of tempered steel, one end being ground off\n   obliquely so as to produce a sharp point, and the other end inserted in\n   a handle; a graver; also, the similarly shaped tool used by workers in\n   marble.'),
(10715, 'Burin', 'n.', 'The manner or style of execution of an engraver; as, a soft\n   burin; a brilliant burin.'),
(10716, 'Burinist', 'n.', 'One who works with the burin.'),
(10717, 'Burion', 'n.', 'The red-breasted house sparrow of California (Carpodacus\n   frontalis); -- called also crimson-fronted bullfinch.'),
(10718, 'Burked', 'imp. & p. p.', 'of Burke'),
(10719, 'Burking', 'p. pr. & vb. n.', 'of Burke'),
(10720, 'Burke', 'v. t.', 'To murder by suffocation, or so as to produce few marks\n   of violence, for the purpose of obtaining a body to be sold for\n   dissection.'),
(10721, 'Burke', 'v. t.', 'To dispose of quietly or indirectly; to suppress; to\n   smother; to shelve; as, to burke a parliamentary question.'),
(10722, 'Burkism', 'n.', 'The practice of killing persons for the purpose of selling\n   their bodies for dissection.'),
(10723, 'Burled', 'imp. & p. p.', 'of Burl'),
(10724, 'Burling', 'p. pr. & vb. n.', 'of Burl'),
(10725, 'Burlap', 'n.', 'A coarse fabric, made of jute or hemp, used for bagging;\n   also, a finer variety of similar material, used for curtains, etc.'),
(10726, 'Burler', 'n.', 'One who burls or dresses cloth.'),
(10727, 'Burletta', 'a.', 'A comic operetta; a music farce.'),
