(10970, 'Cabal', 'n.', 'The secret artifices or machinations of a few persons united\n   in a close design; intrigue.'),
(10971, 'Caballed', 'imp. & p. p.', 'of Cabal'),
(10972, 'Cabal', 'v. i.', 'To unite in a small party to promote private views and\n   interests by intrigue; to intrigue; to plot.'),
(10973, 'Cabala', 'n.', 'A kind of occult theosophy or traditional interpretation of\n   the Scriptures among Jewish rabbis and certain mediaeval Christians,\n   which treats of the nature of god and the mystery of human existence.\n   It assumes that every letter, word, number, and accent of Scripture\n   contains a hidden sense; and it teaches the methods of interpretation\n   for ascertaining these occult meanings. The cabalists pretend even to\n   foretell events by this means.'),
(10974, 'Cabala', 'n.', 'Secret science in general; mystic art; mystery.'),
(10975, 'Cabalism', 'n.', 'The secret science of the cabalists.'),
(10976, 'Cabalism', 'n.', 'A superstitious devotion to the mysteries of the religion\n   which one professes.'),
(10977, 'Cabalist', 'n.', 'One versed in the cabala, or the mysteries of Jewish\n   traditions.'),
(10978, 'Cabalize', 'v. i.', 'To use cabalistic language.'),
(10979, 'Caballer', 'n.', 'One who cabals.'),
(10980, 'Cabaret', 'n.', 'A tavern; a house where liquors are retailed.'),
(10981, 'Cabaret', 'n.', 'a type of restaurant where liquor and dinner is served,\n   and entertainment is provided, as by musicians, dancers, or comedians,\n   and providing space for dancing by the patrons; -- similar to a\n   nightclub. The term cabaret is often used in the names of such an\n   establishment.'),
(10982, 'Cabaret', 'n.', 'the type of entertainment provided in a cabaret{2}.'),
(10983, 'Cabas', 'n.', 'A flat basket or frail for figs, etc.; hence, a lady\'s flat\n   workbasket, reticule, or hand bag; -- often written caba.'),
(10984, 'Cabassou', 'n.', 'A species of armadillo of the genus Xenurus (X.\n   unicinctus and X. hispidus); the tatouay.'),
(10985, 'Cabbage', 'n.', 'An esculent vegetable of many varieties, derived from the\n   wild Brassica oleracea of Europe. The common cabbage has a compact head\n   of leaves. The cauliflower, Brussels sprouts, etc., are sometimes\n   classed as cabbages.'),
(10986, 'Cabbage', 'n.', 'The terminal bud of certain palm trees, used, like,\n   cabbage, for food. See Cabbage tree, below.'),
(10987, 'Cabbage', 'n.', 'The cabbage palmetto. See below.'),
(10988, 'Cabbage', 'v. i.', 'To form a head like that the cabbage; as, to make\n   lettuce cabbage.'),
(10989, 'Cabbaged', 'imp. & p. p', 'of Cabbage'),
(10990, 'Cabbage', 'v. i.', 'To purloin or embezzle, as the pieces of cloth\n   remaining after cutting out a garment; to pilfer.'),
(10991, 'Cabbage', 'n.', 'Cloth or clippings cabbaged or purloined by one who cuts\n   out garments.'),
(10992, 'Cabbler', 'n.', 'One who works at cabbling.'),
(10993, 'Cabbling', 'n.', 'The process of breaking up the flat masses into which\n   wrought iron is first hammered, in order that the pieces may be\n   reheated and wrought into bar iron.'),
(10994, 'Cabeca', 'n.', 'Alt. of Cabesse'),
(10995, 'Cabesse', 'n.', 'The finest kind of silk received from India.'),
(10996, 'Caber', 'n.', 'A pole or beam used in Scottish games for tossing as a trial\n   of strength.'),
(10997, 'Cabezon', 'n.', 'A California fish (Hemilepidotus spinosus), allied to the\n   sculpin.'),
(10998, 'Cabiai', 'n.', 'The capybara. See Capybara.'),
(10999, 'Cabin', 'n.', 'A cottage or small house; a hut.'),
(11000, 'Cabin', 'n.', 'A small room; an inclosed place.'),
(11001, 'Cabin', 'n.', 'A room in ship for officers or passengers.'),
(11002, 'Cabined', 'imp. & p. p.', 'of Cabin'),
(11003, 'Cabining', 'p. pr. & vb. n.', 'of Cabin'),
(11004, 'Cabin', 'v. i.', 'To live in, or as in, a cabin; to lodge.'),
(11005, 'Cabin', 'v. t.', 'To confine in, or as in, a cabin.'),
(11006, 'Cabinet', 'n.', 'A hut; a cottage; a small house.'),
(11007, 'Cabinet', 'n.', 'A small room, or retired apartment; a closet.'),
(11008, 'Cabinet', 'n.', 'A private room in which consultations are held.'),
(11009, 'Cabinet', 'n.', 'The advisory council of the chief executive officer of a\n   nation; a cabinet council.'),
(11010, 'Cabinet', 'n.', 'A set of drawers or a cupboard intended to contain\n   articles of value. Hence:'),
(11011, 'Cabinet', 'n.', 'A decorative piece of furniture, whether open like an\n   etagere or closed with doors. See Etagere.'),
(11012, 'Cabinet', 'n.', 'Any building or room set apart for the safe keeping and\n   exhibition of works of art, etc.; also, the collection itself.'),
(11013, 'Cabinet', 'a.', 'Suitable for a cabinet; small.'),
(11014, 'Cabinet', 'v. i.', 'To inclose'),
(11015, 'Cabirean', 'n.', 'One of the Cabiri.'),
(11016, 'Cabbiri', 'n. pl.', 'Certain deities originally worshiped with mystical\n   rites by the Pelasgians in Lemnos and Samothrace and afterwards\n   throughout Greece; -- also called sons of Hephaestus (or Vulcan), as\n   being masters of the art of working metals.'),
(11017, 'Cabirian', 'a.', 'Same as Cabiric.'),
(11018, 'Cabiric', 'a.', 'Of or pertaining to the Cabiri, or to their mystical\n   worship.'),
(11019, 'Cable', 'n.', 'A large, strong rope or chain, of considerable length, used\n   to retain a vessel at anchor, and for other purposes. It is made of\n   hemp, of steel wire, or of iron links.'),
(11020, 'Cable', 'n.', 'A rope of steel wire, or copper wire, usually covered with\n   some protecting or insulating substance; as, the cable of a suspension\n   bridge; a telegraphic cable.'),
(11021, 'Cable', 'n.', 'A molding, shaft of a column, or any other member of convex,\n   rounded section, made to resemble the spiral twist of a rope; -- called\n   also cable molding.'),
(11022, 'Cable', 'v. t.', 'To fasten with a cable.'),
(11023, 'Cable', 'v. t.', 'To ornament with cabling. See Cabling.'),
(11024, 'Cabled', 'imp. & p. p.', 'of Cable'),
(11025, 'Cabling', 'p. pr. & vb. n.', 'of Cable'),
(11026, 'Cable', 'v. t. & i.', 'To telegraph by a submarine cable'),
(11027, 'Cabled', 'a.', 'Fastened with, or attached to, a cable or rope.'),
(11028, 'Cabled', 'a.', 'Adorned with cabling.'),
(11029, 'Cablet', 'n.', 'A little cable less than ten inches in circumference.'),
(11030, 'Cabling', 'n.', 'The decoration of a fluted shaft of a column or of a\n   pilaster with reeds, or rounded moldings, which seem to be laid in the\n   hollows of the fluting. These are limited in length to about one third\n   of the height of the shaft.'),
(11031, 'Cabmen', 'pl. ', 'of Cabman'),
(11032, 'Cabman', 'n.', 'The driver of a cab.'),
(11033, 'Cabob', 'n.', 'A small piece of mutton or other meat roasted on a skewer;\n   -- so called in Turkey and Persia.'),
(11034, 'Cabob', 'n.', 'A leg of mutton roasted, stuffed with white herrings and\n   sweet herbs.'),
(11035, 'Cabob', 'v. t.', 'To roast, as a cabob.'),
(11036, 'Caboched', 'a.', 'Showing the full face, but nothing of the neck; -- said\n   of the head of a beast in armorial bearing.'),
(11037, 'Caboodle', 'n.', 'The whole collection; the entire quantity or number; --\n   usually in the phrase the whole caboodle.'),
(11038, 'Caboose', 'n.', 'A house on deck, where the cooking is done; -- commonly\n   called the galley.'),
(11039, 'Caboose', 'n.', 'A car used on freight or construction trains for brakemen,\n   workmen, etc.; a tool car.'),
(11040, 'Cabotage', 'n.', 'Navigation along the coast; the details of coast\n   pilotage.'),
(11041, 'Cabree', 'n.', 'The pronghorn antelope.'),
(11042, 'Cabrilla', 'n.', 'A name applied to various species of edible fishes of the\n   genus Serranus, and related genera, inhabiting the Meditarranean, the\n   coast of California, etc. In California, some of them are also called\n   rock bass and kelp salmon.'),
(11043, 'Cabriole', 'n.', 'A curvet; a leap. See Capriole.'),
(11044, 'Cabrit', 'n.', 'Same as Cabree.'),
(11045, 'Caburn', 'n.', 'A small line made of spun yarn, to bind or worm cables,\n   seize tackles, etc.'),
(11046, 'Cacaemia', 'n.', 'Alt. of Cachaemia'),
(11047, 'Cacaine', 'n.', 'The essential principle of cacao; -- now called\n   theobromine.'),
(11048, 'Cacajao', 'n.', 'A South American short-tailed monkey (Pithecia (/\n   Brachyurus) melanocephala).'),
(11049, 'Cacao', 'n.', 'A small evergreen tree (Theobroma Cacao) of South America\n   and the West Indies. Its fruit contains an edible pulp, inclosing seeds\n   about the size of an almond, from which cocoa, chocolate, and broma are\n   prepared.'),
(11050, 'Cachalot', 'n.', 'The sperm whale (Physeter macrocephalus). It has in the\n   top of its head a large cavity, containing an oily fluid, which, after\n   death, concretes into a whitish crystalline substance called\n   spermaceti. See Sperm whale.'),
(11051, 'Cache', 'n.', 'A hole in the ground, or hiding place, for concealing and\n   preserving provisions which it is inconvenient to carry.'),
(11052, 'Cachepot', 'n.', 'An ornamental casing for a flowerpot, of porcelain,\n   metal, paper, etc.'),
(11053, 'Cachet', 'n.', 'A seal, as of a letter.'),
(11054, 'Cachexia', 'n.', 'Alt. of Cachexy'),
(11055, 'Cachexy', 'n.', 'A condition of ill health and impairment of nutrition due\n   to impoverishment of the blood, esp. when caused by a specific morbid\n   process (as cancer or tubercle).'),
(11056, 'Cachiri', 'n.', 'A fermented liquor made in Cayenne from the grated root of\n   the manioc, and resembling perry.'),
(11057, 'Cachou', 'n.', 'A silvered aromatic pill, used to correct the odor of the\n   breath.'),
(11058, 'Cachucha', 'n.', 'An Andalusian dance in three-four time, resembling the\n   bolero.'),
(11059, 'Cachunde', 'n.', 'A pastil or troche, composed of various aromatic and\n   other ingredients, highly celebrated in India as an antidote, and as a\n   stomachic and antispasmodic.'),
(11060, 'Cacique', 'n.', 'See Cazique.'),
(11061, 'Cackerel', 'n.', 'The mendole; a small worthless Mediterranean fish\n   considered poisonous by the ancients. See Mendole.'),
(11062, 'Cackled', 'imp. & p. p.', 'of Cackle'),
(11063, 'Cackling', 'p. pr. & vb. n.', 'of Cackle'),
(11064, 'Cackle', 'v. i.', 'To make a sharp, broken noise or cry, as a hen or goose\n   does.'),
(11065, 'Cackle', 'v. i.', 'To laugh with a broken noise, like the cackling of a hen\n   or a goose; to giggle.'),
(11066, 'Cackle', 'v. i.', 'To talk in a silly manner; to prattle.'),
(11067, 'Cackle', 'n.', 'The sharp broken noise made by a goose or by a hen that has\n   laid an egg.'),
(11068, 'Cackle', 'n.', 'Idle talk; silly prattle.'),
(11069, 'Cackler', 'n.', 'A fowl that cackles.'),
(11070, 'Cackler', 'n.', 'One who prattles, or tells tales; a tattler.'),
(11071, 'Cackling', 'n.', 'The broken noise of a goose or a hen.'),
(11072, 'Cacodoxy', 'n.', 'Erroneous doctrine; heresy; heterodoxy.'),
(11073, 'Cacodyl', 'n.', 'Alkarsin; a colorless, poisonous, arsenical liquid,\n   As2(CH3)4, spontaneously inflammable and possessing an intensely\n   disagreeable odor. It is the type of a series of compounds analogous to\n   the nitrogen compounds called hydrazines.'),
(11074, 'Cacolet', 'n.', 'A chair, litter, or other contrivance fitted to the back\n   or pack saddle of a mule for carrying travelers in mountainous\n   districts, or for the transportation of the sick and wounded of an\n   army.'),
(11075, 'Cacology', 'n.', 'Bad speaking; bad choice or use of words.'),
(11076, 'Cacomixl', 'n.', 'A North American carnivore (Bassaris astuta), about the\n   size of a cat, related to the raccoons. It inhabits Mexico, Texas, and\n   California.'),
(11077, 'Cacoon', 'n.', 'One of the seeds or large beans of a tropical vine (Entada\n   scandens) used for making purses, scent bottles, etc.'),
(11078, 'Cacoxene', 'n.', 'Alt. of Cacoxenite'),
(11079, 'Cactuses', 'pl. ', 'of Cactus'),
(11080, 'Cacti', 'pl. ', 'of Cactus'),
(11081, 'Cactus', 'n.', 'Any plant of the order Cactacae, as the prickly pear and\n   the night-blooming cereus. See Cereus. They usually have leafless stems\n   and branches, often beset with clustered thorns, and are mostly natives\n   of the warmer parts of America.'),
(11082, 'Cadastre', 'n.', 'Alt. of Cadaster'),
(11083, 'Cadaster', 'n.', 'An official statement of the quantity and value of real\n   estate for the purpose of apportioning the taxes payable on such\n   property.'),
(11084, 'Cadaver', 'n.', 'A dead human body; a corpse.'),
(11085, 'Cadbait', 'n.', 'See Caddice.'),
(11086, 'Caddice', 'n.', 'Alt. of Caddis'),
(11087, 'Caddis', 'n.', 'The larva of a caddice fly. These larvae generally live in\n   cylindrical cases, open at each end, and covered externally with pieces\n   of broken shells, gravel, bits of wood, etc. They are a favorite bait\n   with anglers. Called also caddice worm, or caddis worm.'),
(11088, 'Caddis', 'n.', 'A kind of worsted lace or ribbon.'),
(11089, 'Caddish', 'a.', 'Like a cad; lowbred and presuming.'),
(11090, 'Caddow', 'n.', 'A jackdaw.'),
(11091, 'Caddies', 'pl. ', 'of Caddy'),
(11092, 'Caddy', 'n.', 'A small box, can, or chest to keep tea in.'),
(11093, 'Cadence', 'n.', 'The act or state of declining or sinking.'),
(11094, 'Cadence', 'n.', 'A fall of the voice in reading or speaking, especially at\n   the end of a sentence.'),
(11095, 'Cadence', 'n.', 'A rhythmical modulation of the voice or of any sound; as,\n   music of bells in cadence sweet.'),
(11096, 'Cadence', 'n.', 'Rhythmical flow of language, in prose or verse.'),
(11097, 'Cadence', 'n.', 'See Cadency.'),
(11098, 'Cadence', 'n.', 'Harmony and proportion in motions, as of a well-managed\n   horse.'),
(11099, 'Cadence', 'n.', 'A uniform time and place in marching.'),
(11100, 'Cadence', 'n.', 'The close or fall of a strain; the point of rest, commonly\n   reached by the immediate succession of the tonic to the dominant chord.'),
(11101, 'Cadence', 'n.', 'A cadenza, or closing embellishment; a pause before the\n   end of a strain, which the performer may fill with a flight of fancy.'),
(11102, 'Cadence', 'v. t.', 'To regulate by musical measure.'),
(11103, 'Cadency', 'n.', 'Descent of related families; distinction between the\n   members of a family according to their ages.'),
(11104, 'Cadene', 'n.', 'A species of inferior carpet imported from the Levant.'),
(11105, 'Cadent', 'a.', 'Falling.'),
(11106, 'Cadenza', 'n.', 'A parenthetic flourish or flight of ornament in the course\n   of a piece, commonly just before the final cadence.'),
(11107, 'Cader', 'n.', 'See Cadre.'),
(11108, 'Cadet', 'n.', 'The younger of two brothers; a younger brother or son; the\n   youngest son.'),
(11109, 'Cadet', 'n.', 'A gentleman who carries arms in a regiment, as a volunteer,\n   with a view of acquiring military skill and obtaining a commission.'),
(11110, 'Cadet', 'n.', 'A young man in training for military or naval service; esp.\n   a pupil in a military or naval school, as at West Point, Annapolis, or\n   Woolwich.'),
(11111, 'Cadew', 'n.', 'Alt. of Cadeworm'),
(11112, 'Cadeworm', 'n.', 'A caddice. See Caddice.'),
(11113, 'Cadged', 'imp. & p. p.', 'of Cadge'),
(11114, 'Cadging', 'p. pr. & vb. n.', 'of Cadge'),
(11115, 'Cadge', 'v. t. & i.', 'To carry, as a burden.'),
(11116, 'Cadge', 'v. t. & i.', 'To hawk or peddle, as fish, poultry, etc.'),
(11117, 'Cadge', 'v. t. & i.', 'To intrude or live on another meanly; to beg.'),
(11118, 'Cadge', 'n.', 'A circular frame on which cadgers carry hawks for sale.'),
(11119, 'Cadger', 'v. t.', 'A packman or itinerant huckster.'),
(11120, 'Cadger', 'v. t.', 'One who gets his living by trickery or begging.'),
(11121, 'Cadger', 'n.', 'One who carries hawks on a cadge.'),
(11122, 'Cadgy', 'a.', 'Cheerful or mirthful, as after good eating or drinking;\n   also, wanton.'),
(11123, 'Cadie', 'n.', 'Alt. of Caddie'),
(11124, 'Caddie', 'n.', 'A Scotch errand boy, porter, or messenger.'),
(11125, 'Cadillac', 'n.', 'A large pear, shaped like a flattened top, used chiefly\n   for cooking.'),
(11126, 'Cadis', 'n.', 'A kind of coarse serge.'),
(11127, 'Cadmean', 'a.', 'Of or pertaining to Cadmus, a fabulous prince of Thebes,\n   who was said to have introduced into Greece the sixteen simple letters\n   of the alphabet -- /, /, /, /, /, /, /, /, /, /, /, /, /, /, /, /.\n   These are called Cadmean letters.'),
(11128, 'Cadmia', 'n.', 'An oxide of zinc which collects on the sides of furnaces\n   where zinc is sublimed. Formerly applied to the mineral calamine.'),
(11129, 'Cadmian', 'a.', 'See Cadmean.'),
(11130, 'Cadmic', 'a.', 'Pertaining to, derived from, or containing, cadmium; as,\n   cadmic sulphide.'),
(11131, 'Cadmium', 'n.', 'A comparatively rare element related to zinc, and\n   occurring in some zinc ores. It is a white metal, both ductile and\n   malleable. Symbol Cd. Atomic weight 111.8. It was discovered by\n   Stromeyer in 1817, who named it from its association with zinc or zinc\n   ore.'),
(11132, 'Cadrans', 'n.', 'An instrument with a graduated disk by means of which the\n   angles of gems are measured in the process of cutting and polishing.'),
(11133, 'Cadre', 'n.', 'The framework or skeleton upon which a regiment is to be\n   formed; the officers of a regiment forming the staff.'),
(11134, 'Caducary', 'a.', 'Relating to escheat, forfeiture, or confiscation.'),
(11135, 'Caducean', 'a.', 'Of or belonging to Mercury\'s caduceus, or wand.'),
(11136, 'Caduceus', 'n.', 'The official staff or wand of Hermes or Mercury, the\n   messenger of the gods. It was originally said to be a herald\'s staff of\n   olive wood, but was afterwards fabled to have two serpents coiled about\n   it, and two wings at the top.'),
(11137, 'Caducity', 'n.', 'Tendency to fall; the feebleness of old age; senility.'),
(11138, 'Caducous', '', 'Dropping off or disappearing early, as the calyx of a\n   poppy, or the gills of a tadpole.'),
(11139, 'Caduke', 'a.', 'Perishable; frail; transitory.'),
(11140, 'Caeca', 'n. pl.', 'See Caecum.'),
(11141, 'Caecal', 'a.', 'Of or pertaining to the caecum, or blind gut.'),
(11142, 'Caecal', 'a.', 'Having the form of a caecum, or bag with one opening;\n   baglike; as, the caecal extremity of a duct.'),
(11143, 'Caecias', 'n.', 'A wind from the northeast.'),
(11144, 'Caecums', 'pl. ', 'of Caecum'),
(11145, 'Caeca', 'pl. ', 'of Caecum'),
(11146, 'Caecum', 'n.', 'A cavity open at one end, as the blind end of a canal or\n   duct.'),
(11147, 'Caecum', 'n.', 'The blind part of the large intestine beyond the entrance\n   of the small intestine; -- called also the blind gut.'),
(11148, 'Caesar', 'n.', 'A Roman emperor, as being the successor of Augustus Caesar.\n   Hence, a kaiser, or emperor of Germany, or any emperor or powerful\n   ruler. See Kaiser, Kesar.'),
(11149, 'Caesious', 'a.', 'Of the color of lavender; pale blue with a slight mixture\n   of gray.'),
(11150, 'Caesium', 'n.', 'A rare alkaline metal found in mineral water; -- so called\n   from the two characteristic blue lines in its spectrum. It was the\n   first element discovered by spectrum analysis, and is the most strongly\n   basic and electro-positive substance known. Symbol Cs. Atomic weight\n   132.6.'),
(11151, 'Caesuras', 'pl. ', 'of Caesura'),
(11152, 'Caesurae', 'pl. ', 'of Caesura'),
(11153, 'Caesura', 'n.', 'A metrical break in a verse, occurring in the middle of a\n   foot and commonly near the middle of the verse; a sense pause in the\n   middle of a foot. Also, a long syllable on which the caesural accent\n   rests, or which is used as a foot.'),
(11154, 'Caesural', 'a.', 'Of or pertaining to a caesura.'),
(11155, 'Cafenet', 'n.', 'Alt. of Cafeneh'),
(11156, 'Cafeneh', 'n.', 'A humble inn or house of rest for travelers, where coffee\n   is sold.'),
(11157, 'Caffeic', 'a.', 'Pertaining to, or obtained from, coffee.'),
(11158, 'Caffeine', 'n.', 'A white, bitter, crystallizable substance, obtained from\n   coffee. It is identical with the alkaloid theine from tea leaves, and\n   with guaranine from guarana.'),
(11159, 'Caffila', 'n.', 'See Cafila.'),
(11160, 'Caffre', 'n.', 'See Kaffir.'),
(11161, 'Cafila', 'n.', 'Alt. of Cafileh'),
(11162, 'Cafileh', 'n.', 'A caravan of travelers; a military supply train or\n   government caravan; a string of pack horses.'),
(11163, 'Caftan', 'n.', 'A garment worn throughout the Levant, consisting of a long\n   gown with sleeves reaching below the hands. It is generally fastened by\n   a belt or sash.'),
(11164, 'Caftan', 'v. t.', 'To clothe with a caftan.'),
(11165, 'Caged', 'imp. & p. p.', 'of Cage'),
(11166, 'Caging', 'p. pr. & vb. n.', 'of Cage'),
(11167, 'Caged', 'a.', 'Confined in, or as in, a cage; like a cage or prison.'),
(11168, 'Cageling', 'n.', 'A bird confined in a cage; esp. a young bird.'),
(11169, 'Cagit', 'n.', 'A kind of parrot, of a beautiful green color, found in the\n   Philippine Islands.'),
(11170, 'Cagmag', 'n.', 'A tough old goose; hence, coarse, bad food of any kind.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(11171, 'Cagot', 'n.', 'One of a race inhabiting the valleys of the Pyrenees, who\n   until 1793 were political and social outcasts (Christian Pariahs). They\n   are supposed to be a remnant of the Visigoths.'),
(11172, 'Cahier', 'n.', 'A number of sheets of paper put loosely together; esp. one\n   of the successive portions of a work printed in numbers.'),
(11173, 'Cahier', 'n.', 'A memorial of a body; a report of legislative proceedings,\n   etc.'),
(11174, 'Cahincic', 'a.', 'Pertaining to, or derived from, cahinca, the native name\n   of a species of Brazilian Chiococca, perhaps C. racemosa; as, cahincic\n   acid.'),
(11175, 'Cahoot', 'n.', 'Partnership; as, to go in cahoot with a person.'),
(11176, 'Caimacam', 'n.', 'The governor of a sanjak or district in Turkey.'),
(11177, 'Caiman', 'n.', 'See Cayman.'),
(11178, 'Caique', 'n.', 'A light skiff or rowboat used on the Bosporus; also, a\n   Levantine vessel of larger size.'),
(11179, 'Ca ira', '', 'The refrain of a famous song of the French Revolution.'),
(11180, 'Caird', 'n.', 'A traveling tinker; also a tramp or sturdy beggar.'),
(11181, 'Cairn', 'n.', 'A rounded or conical heap of stones erected by early\n   inhabitants of the British Isles, apparently as a sepulchral monument.'),
(11182, 'Cairn', 'n.', 'A pile of stones heaped up as a landmark, or to arrest\n   attention, as in surveying, or in leaving traces of an exploring party,\n   etc.'),
(11183, 'Caisson', 'n.', 'A chest to hold ammunition.'),
(11184, 'Caisson', 'n.', 'A four-wheeled carriage for conveying ammunition,\n   consisting of two parts, a body and a limber. In light field batteries\n   there is one caisson to each piece, having two ammunition boxes on the\n   body, and one on the limber.'),
(11185, 'Caisson', 'n.', 'A chest filled with explosive materials, to be laid in the\n   way of an enemy and exploded on his approach.'),
(11186, 'Caisson', 'n.', 'A water-tight box, of timber or iron within which work is\n   carried on in building foundations or structures below the water level.'),
(11187, 'Caisson', 'n.', 'A hollow floating box, usually of iron, which serves to\n   close the entrances of docks and basins.'),
(11188, 'Caisson', 'n.', 'A structure, usually with an air chamber, placed beneath a\n   vessel to lift or float it.'),
(11189, 'Caisson', 'n.', 'A sunk panel of ceilings or soffits.'),
(11190, 'Caitiff', 'a.', 'Captive; wretched; unfortunate.'),
(11191, 'Caitiff', 'a.', 'Base; wicked and mean; cowardly; despicable.'),
(11192, 'Caitiff', 'n.', 'A captive; a prisoner.'),
(11193, 'Caitiff', 'n.', 'A wretched or unfortunate man.'),
(11194, 'Caitiff', 'n.', 'A mean, despicable person; one whose character meanness\n   and wickedness meet.'),
(11195, 'Cajeput', 'n.', 'See Cajuput.'),
(11196, 'Cajoled', 'imp. & p. p.', 'of Cajole'),
(11197, 'Cajoling', 'p. pr. & vb. n.', 'of Cajole'),
(11198, 'Cajole', 'v. i.', 'To deceive with flattery or fair words; to wheedle.'),
(11199, 'Cajoler', 'n.', 'A flatterer; a wheedler.'),
(11200, 'Cajolery', 'n.', 'A wheedling to delude; words used in cajoling; flattery.'),
(11201, 'Cajuput', 'n.', 'A highly stimulating volatile inflammable oil, distilled\n   from the leaves of an East Indian tree (Melaleuca cajuputi, etc.) It is\n   greenish in color and has a camphoraceous odor and pungent taste.'),
(11202, 'Caked', 'imp. & p. p.', 'of Cake'),
(11203, 'Caking', 'p. pr. & vb. n.', 'of Cake'),
(11204, 'Calabar', 'n.', 'A district on the west coast of Africa.'),
(11205, 'Calabash', 'n.', 'The common gourd (plant or fruit).'),
(11206, 'Calabash', 'n.', 'The fruit of the calabash tree.'),
(11207, 'Calabash', 'n.', 'A water dipper, bottle, bascket, or other utensil, made\n   from the dry shell of a calabash or gourd.'),
(11208, 'Calade', 'n.', 'A slope or declivity in a manege ground down which a horse\n   is made to gallop, to give suppleness to his haunches.'),
(11209, 'Caladium', 'n.', 'A genus of aroideous plants, of which some species are\n   cultivated for their immense leaves (which are often curiously blotched\n   with white and red), and others (in Polynesia) for food.'),
(11210, 'Calaite', 'n.', 'A mineral. See Turquoise.'),
(11211, 'Calamar', 'n.', 'Alt. of Calamary'),
(11212, 'Calamary', 'n.', 'A cephalopod, belonging to the genus Loligo and related\n   genera. There are many species. They have a sack of inklike fluid which\n   they discharge from the siphon tube, when pursued or alarmed, in order\n   to confuse their enemies. Their shell is a thin horny plate, within the\n   flesh of the back, shaped very much like a quill pen. In America they\n   are called squids. See Squid.'),
(11213, 'Calambac', 'n.', 'A fragrant wood; agalloch.'),
(11214, 'Calamine', 'n.', 'A mineral, the hydrous silicate of zinc.'),
(11215, 'Calamint', 'n.', 'A genus of perennial plants (Calamintha) of the Mint\n   family, esp. the C. Nepeta and C. Acinos, which are called also basil\n   thyme.'),
(11216, 'Calamist', 'n.', 'One who plays upon a reed or pipe.'),
(11217, 'Calamite', 'n.', 'A fossil plant of the coal formation, having the general\n   form of plants of the modern Equiseta (the Horsetail or Scouring Rush\n   family) but sometimes attaining the height of trees, and having the\n   stem more or less woody within. See Acrogen, and Asterophyllite.'),
(11218, 'Calamity', 'n.', 'Any great misfortune or cause of misery; -- generally\n   applied to events or disasters which produce extensive evil, either to\n   communities or individuals.'),
(11219, 'Calamity', 'n.', 'A state or time of distress or misfortune; misery.'),
(11220, 'Calami', 'pl. ', 'of Calamus'),
(11221, 'Calamus', 'n.', 'The indian cane, a plant of the Palm family. It furnishes\n   the common rattan. See Rattan, and Dragon\'s blood.'),
(11222, 'Calamus', 'n.', 'A species of Acorus (A. calamus), commonly called calamus,\n   or sweet flag. The root has a pungent, aromatic taste, and is used in\n   medicine as a stomachic; the leaves have an aromatic odor, and were\n   formerly used instead of rushes to strew on floors.'),
(11223, 'Calamus', 'n.', 'The horny basal portion of a feather; the barrel or quill.'),
(11224, 'Calando', 'a.', 'Gradually diminishing in rapidity and loudness.'),
(11225, 'Calash', 'n.', 'A light carriage with low wheels, having a top or hood that\n   can be raised or lowered, seats for inside, a separate seat for the\n   driver, and often a movable front, so that it can be used as either an\n   open or a close carriage.'),
(11226, 'Calash', 'n.', 'In Canada, a two-wheeled, one-seated vehicle, with a calash\n   top, and the driver\'s seat elevated in front.'),
(11227, 'Calash', 'n.', 'A hood or top of a carriage which can be thrown back at\n   pleasure.'),
(11228, 'Calash', 'n.', 'A hood, formerly worn by ladies, which could be drawn\n   forward or thrown back like the top of a carriage.'),
(11229, '-neums', 'pl. ', 'of Calcaneum'),
(11230, 'Calcar', 'n.', 'A kind of oven, or reverberatory furnace, used for the\n   calcination of sand and potash, and converting them into frit.'),
(11231, 'Calcaria', 'pl. ', 'of Calcar'),
(11232, 'Calcar', 'n.', 'A hollow tube or spur at the base of a petal or corolla.'),
(11233, 'Calcar', 'n.', 'A slender bony process from the ankle joint of bats, which\n   helps to support the posterior part of the web, in flight.'),
(11234, 'Calcar', 'n.', 'A spur, or spurlike prominence.'),
(11235, 'Calcar', 'n.', 'A curved ridge in the floor of the leteral ventricle of the\n   brain; the calcar avis, hippocampus minor, or ergot.'),
(11236, 'Calced', 'a.', 'Wearing shoes; calceated; -- in distintion from discalced\n   or barefooted; as the calced Carmelites.'),
(11237, 'Calcedon', 'n.', 'A foul vein, like chalcedony, in some precious stones.'),
(11238, 'Calces', 'n. pl.', 'See Calx.'),
(11239, 'Calcic', 'a.', 'Pertaining to, derived from, or containing, calcium or\n   lime.'),
(11240, 'Calcific', 'a.', 'Calciferous. Specifically: (Zool.) of or pertaining to\n   the portion of the oviduct which forms the eggshell in birds and\n   reptiles.'),
(11241, 'Calcify', 'v. t.', 'To make stony or calcareous by the deposit or secretion\n   of salts of lime.'),
(11242, 'Calcify', 'v. i.', 'To become changed into a stony or calcareous condition,\n   in which lime is a principal ingredient, as in the formation of teeth.'),
(11243, 'Calciden', 'imp. & p. p.', 'of Calcine'),
(11244, 'Calcine', 'v. i.', 'To reduce to a powder, or to a friable state, by the\n   action of heat; to expel volatile matter from by means of heat, as\n   carbonic acid from limestone, and thus (usually) to produce\n   disintegration; as to, calcine bones.'),
(11245, 'Calcine', 'v. i.', 'To oxidize, as a metal by the action of heat; to reduce\n   to a metallic calx.'),
(11246, 'Calcine', 'v. i.', 'To be converted into a powder or friable substance, or\n   into a calx, by the action of heat.'),
(11247, 'Calciner', 'n.', 'One who, or that which, calcines.'),
(11248, 'Calcite', 'n.', 'Calcium carbonate, or carbonate of lime. It is\n   rhombohedral in its crystallization, and thus distinguished from\n   aragonite. It includes common limestone, chalk, and marble. Called also\n   calc-spar and calcareous spar.'),
(11249, 'Calcium', 'n.', 'An elementary substance; a metal which combined with\n   oxygen forms lime. It is of a pale yellow color, tenacious, and\n   malleable. It is a member of the alkaline earth group of elements.\n   Atomic weight 40. Symbol Ca.'),
(11250, 'Calcule', 'n.', 'Reckoning; computation.'),
(11251, 'Calcule', 'v. i.', 'To calculate'),
(11252, 'Calculi', 'n. pl.', 'See Calculus.'),
(11253, 'Calculi', 'pl. ', 'of Calculus'),
(11254, 'Calculus', 'n.', 'Any solid concretion, formed in any part of the body, but\n   most frequent in the organs that act as reservoirs, and in the passages\n   connected with them; as, biliary calculi; urinary calculi, etc.'),
(11255, 'Calculus', 'n.', 'A method of computation; any process of reasoning by the\n   use of symbols; any branch of mathematics that may involve calculation.'),
(11256, 'Caldron', 'n.', 'A large kettle or boiler of copper, brass, or iron.\n   [Written also cauldron.]'),
(11257, 'Caleche', 'n.', 'See Calash.'),
(11258, 'Calefied', 'imp. & p. p.', 'of Calefy'),
(11259, 'Calefy', 'v. i.', 'To make warm or hot.'),
(11260, 'Calefy', 'v. i.', 'To grow hot or warm.'),
(11261, 'Calendar', 'n.', 'An orderly arrangement of the division of time, adapted\n   to the purposes of civil life, as years, months, weeks, and days; also,\n   a register of the year with its divisions; an almanac.'),
(11262, 'Calendar', 'n.', 'A tabular statement of the dates of feasts, offices,\n   saints\' days, etc., esp. of those which are liable to change yearly\n   according to the varying date of Easter.'),
(11263, 'Calendar', 'n.', 'An orderly list or enumeration of persons, things, or\n   events; a schedule; as, a calendar of state papers; a calendar of bills\n   presented in a legislative assembly; a calendar of causes arranged for\n   trial in court; a calendar of a college or an academy.'),
(11264, 'Calendar', 'v. t.', 'To enter or write in a calendar; to register.'),
(11265, 'Calender', 'n.', 'A machine, used for the purpose of giving cloth, paper,\n   etc., a smooth, even, and glossy or glazed surface, by cold or hot\n   pressure, or for watering them and giving them a wavy appearance. It\n   consists of two or more cylinders revolving nearly in contact, with the\n   necessary apparatus for moving and regulating.'),
(11266, 'Calender', 'n.', 'One who pursues the business of calendering.'),
(11267, 'Calender', 'n.', 'To press between rollers for the purpose of making smooth\n   and glossy, or wavy, as woolen and silk stuffs, linens, paper, etc.'),
(11268, 'Calender', 'n.', 'One of a sect or order of fantastically dressed or\n   painted dervishes.'),
(11269, 'Calends', 'n. pl.', 'The first day of each month in the ancient Roman\n   calendar.'),
(11270, 'Calves', 'pl. ', 'of Calf'),
(11271, 'Calfskin', 'n.', 'The hide or skin of a calf; or leather made of the skin.'),
(11272, 'Caliber', 'n.', 'Alt. of Calibre'),
(11273, 'Calibre', 'n.', 'The diameter of the bore, as a cannon or other firearm, or\n   of any tube; or the weight or size of the projectile which a firearm\n   will carry; as, an 8 inch gun, a 12-pounder, a 44 caliber.'),
(11274, 'Calibre', 'n.', 'The diameter of round or cylindrical body, as of a bullet\n   or column.'),
(11275, 'Calibre', 'n.', 'Fig.: Capacity or compass of mind.'),
(11276, 'Calice', 'n.', 'See Chalice.'),
(11277, 'Calicle', 'n.', 'One of the small cuplike cavities, often with elevated\n   borders, covering the surface of most corals. Each is formed by a\n   polyp. (b) One of the cuplike structures inclosing the zooids of\n   certain hydroids. See Campanularian.'),
(11278, 'Calicoes', 'pl. ', 'of Calico'),
(11279, 'Calico', 'n.', 'Plain white cloth made from cotton, but which receives\n   distinctive names according to quality and use, as, super calicoes,\n   shirting calicoes, unbleached calicoes, etc.'),
(11280, 'Calico', 'n.', 'Cotton cloth printed with a figured pattern.'),
(11281, 'Calico', 'a.', 'Made of, or having the appearance of, calico; -- often\n   applied to an animal, as a horse or cat, on whose body are large\n   patches of a color strikingly different from its main color.'),
(11282, 'Calid', 'a.', 'Hot; burning; ardent.'),
(11283, 'Calidity', 'n.', 'Heat.'),
(11284, 'Caliduct', 'n.', 'A pipe or duct used to convey hot air or steam.'),
(11285, 'Calif', 'n.', 'Alt. of Califate'),
(11286, 'Califate', 'n.', 'Same as Caliph, Caliphate, etc.'),
(11287, 'Caligo', 'n.', 'Dimness or obscurity of sight, dependent upon a speck on\n   the cornea; also, the speck itself.'),
(11288, 'Calin', 'n.', 'An alloy of lead and tin, of which the Chinese make tea\n   canisters.'),
(11289, 'Calipash', 'n.', 'A part of a turtle which is next to the upper shell. It\n   contains a fatty and gelatinous substance of a dull greenish tinge,\n   much esteemed as a delicacy in preparations of turtle.'),
(11290, 'Calipee', 'n.', 'A part of a turtle which is attached to the lower shell.\n   It contains a fatty and gelatinous substance of a light yellowish\n   color, much esteemed as a delicacy.'),
(11291, 'Calipers', 'n. pl.', 'An instrument, usually resembling a pair of dividers\n   or compasses with curved legs, for measuring the diameter or thickness\n   of bodies, as of work shaped in a lathe or planer, timber, masts, shot,\n   etc.; or the bore of firearms, tubes, etc.; -- called also caliper\n   compasses, or caliber compasses.'),
(11292, 'Caliph', 'n.', 'Successor or vicar; -- a title of the successors of\n   Mohammed both as temporal and spiritual rulers, now used by the sultans\n   of Turkey.'),
(11293, 'Calippic', 'a.', 'Of or pertaining to Calippus, an Athenian astronomer.'),
(11294, 'Caliver', 'n.', 'An early form of hand gun, variety of the arquebus;\n   originally a gun having a regular size of bore.'),
(11295, 'Calix', 'n.', 'A cup. See Calyx.'),
(11296, 'Calked', 'imp. &p. p.', 'of Calk'),
(11297, 'Calking', 'p. pr. & vb. n.', 'of Calk'),
(11298, 'Calker', 'n.', 'One who calks.'),
(11299, 'Calker', 'n.', 'A calk on a shoe. See Calk, n., 1.'),
(11300, 'Calkin', 'n.', 'A calk on a shoe. See Calk, n., 1.'),
(11301, 'Calking', 'n.', 'The act or process of making seems tight, as in ships, or\n   of furnishing with calks, as a shoe, or copying, as a drawing.'),
(11302, 'Called', 'imp. & p. p.', 'of Call'),
(11303, 'Calling', 'p. pr. & vb. n.', 'of Call'),
(11304, 'Calla', 'n.', 'A genus of plants, of the order Araceae.'),
(11305, 'Callat', 'n.', 'Same as Callet.'),
(11306, 'Calle', 'n.', 'A kind of head covering; a caul.'),
(11307, 'Caller', 'n.', 'One who calls.'),
(11308, 'Caller', 'a.', 'Cool; refreshing; fresh; as, a caller day; the caller air.'),
(11309, 'Caller', 'a.', 'Fresh; in good condition; as, caller berrings.'),
(11310, 'Callet', 'n.', 'A trull or prostitute; a scold or gossip.'),
(11311, 'Callet', 'v. i.', 'To rail or scold.'),
(11312, 'Callid', 'a.', 'Characterized by cunning or shrewdness; crafty.'),
(11313, 'Calling', 'n.', 'The act of one who calls; a crying aloud, esp. in order to\n   summon, or to attact the attention of, some one.'),
(11314, 'Calling', 'n.', 'A summoning or convocation, as of Parliament.'),
(11315, 'Calling', 'n.', 'A divine summons or invitation; also, the state of being\n   divinely called.'),
(11316, 'Calling', 'n.', 'A naming, or inviting; a reading over or reciting in\n   order, or a call of names with a view to obtaining an answer, as in\n   legislative bodies.'),
(11317, 'Calling', 'n.', 'One\'s usual occupation, or employment; vocation; business;\n   trade.'),
(11318, 'Calling', 'n.', 'The persons, collectively, engaged in any particular\n   professions or employment.'),
(11319, 'Calling', 'n.', 'Title; appellation; name.'),
(11320, 'Calliope', 'n.', 'The Muse that presides over eloquence and heroic poetry;\n   mother of Orpheus, and chief of the nine Muses.'),
(11321, 'Calliope', 'n.', 'One of the asteroids. See Solar.'),
(11322, 'Calliope', 'n.', 'A musical instrument consisting of a series of steam\n   whistles, toned to the notes of the scale, and played by keys arranged\n   like those of an organ. It is sometimes attached to steamboat boilers.'),
(11323, 'Calliope', 'n.', 'A beautiful species of humming bird (Stellula Calliope)\n   of California and adjacent regions.'),
(11324, 'Callipee', 'n.', 'See Calipee.'),
(11325, 'Callosan', 'a.', 'Of the callosum.'),
(11326, 'Callose', 'a.', 'Furnished with protuberant or hardened spots.'),
(11327, 'Callosum', 'n.', 'The great band commissural fibers which unites the two\n   cerebral hemispheres. See corpus callosum, under Carpus.'),
(11328, 'Callot', 'n.', 'A plant coif or skullcap. Same as Calotte.'),
(11329, 'Callous', 'a.', 'Hardened; indurated.'),
(11330, 'Callous', 'a.', 'Hardened in mind; insensible; unfeeling; unsusceptible.'),
(11331, 'Callow', 'a.', 'Destitute of feathers; naked; unfledged.'),
(11332, 'Callow', 'a.', 'Immature; boyish; \"green\"; as, a callow youth.'),
(11333, 'Callow', 'n.', 'A kind of duck. See Old squaw.'),
(11334, 'Callus', 'n.', 'Same as Callosity'),
(11335, 'Callus', 'n.', 'The material of repair in fractures of bone; a substance\n   exuded at the site of fracture, which is at first soft or cartilaginous\n   in consistence, but is ultimately converted into true bone and unites\n   the fragments into a single piece.'),
(11336, 'Callus', 'n.', 'The new formation over the end of a cutting, before it puts\n   out rootlets.'),
(11337, 'Calmed', 'imp. & p. p.', 'of Calm'),
(11338, 'Calming', 'p. pr. & vb. n.', 'of Calm'),
(11339, 'Calmer', 'n.', 'One who, or that which, makes calm.'),
(11340, 'Calmly', 'adv.', 'In a calm manner.'),
(11341, 'Calmness', 'n.', 'The state of quality of being calm; quietness;\n   tranquillity; self-repose.'),
(11342, 'Calmucks', 'n. pl.', 'A branch of the Mongolian race inhabiting parts of\n   the Russian and Chinese empires; also (sing.), the language of the\n   Calmucks.'),
(11343, 'Calmy', 'n.', 'Tranquil; peaceful; calm.'),
(11344, 'Calomel', 'n.', 'Mild chloride of mercury, Hg2Cl2, a heavy, white or\n   yellowish white substance, insoluble and tasteless, much used in\n   medicine as a mercurial and purgative; mercurous chloride. It occurs\n   native as the mineral horn quicksilver.'),
(11345, 'Caloric', 'n.', 'The principle of heat, or the agent to which the phenomena\n   of heat and combustion were formerly ascribed; -- not now used in\n   scientific nomenclature, but sometimes used as a general term for heat.'),
(11346, 'Caloric', 'a.', 'Of or pertaining to caloric.'),
(11347, 'Calorie', 'n.', 'The unit of heat according to the French standard; the\n   amount of heat required to raise the temperature of one kilogram\n   (sometimes, one gram) of water one degree centigrade, or from 0¡ to 1¡.\n   Compare the English standard unit, Foot pound.'),
(11348, 'Calotte', 'n.', 'Alt. of Callot'),
(11349, 'Callot', 'n.', 'A close cap without visor or brim.'),
(11350, 'Callot', 'n.', 'Such a cap, worn by English serjeants at law.'),
(11351, 'Callot', 'n.', 'Such a cap, worn by the French cavalry under their helmets.'),
(11352, 'Callot', 'n.', 'Such a cap, worn by the clergy of the Roman Catholic\n   Church.'),
(11353, 'Calotype', 'n.', 'A method of taking photographic pictures, on paper\n   sensitized with iodide of silver; -- also called Talbotype, from the\n   inventor, Mr. Fox. Talbot.'),
(11354, 'Caloyer', 'n.', 'A monk of the Greek Church; a cenobite, anchoret, or\n   recluse of the rule of St. Basil, especially, one on or near Mt. Athos.'),
(11355, 'Calque', 'v. t.', 'See 2d Calk, v. t.'),
(11356, 'Caltrop', 'n.', 'Alt. of Caltrap'),
(11357, 'Caltrap', 'n.', 'A genus of herbaceous plants (Tribulus) of the order\n   Zygophylleae, having a hard several-celled fruit, armed with stout\n   spines, and resembling the military instrument of the same name. The\n   species grow in warm countries, and are often very annoying to cattle.'),
(11358, 'Caltrap', 'n.', 'An instrument with four iron points, so disposed that, any\n   three of them being on the ground, the other projects upward. They are\n   scattered on the ground where an enemy\'s cavalry are to pass, to impede\n   their progress by endangering the horses\' feet.'),
(11359, 'Calumba', 'n.', 'The root of a plant (Jateorrhiza Calumba, and probably\n   Cocculus palmatus), indigenous in Mozambique. It has an unpleasantly\n   bitter taste, and is used as a tonic and antiseptic.'),
(11360, 'Calumbin', 'n.', 'A bitter principle extracted as a white crystalline\n   substance from the calumba root.'),
(11361, 'Calumet', 'n.', 'A kind of pipe, used by the North American Indians for\n   smoking tobacco. The bowl is usually made of soft red stone, and the\n   tube is a long reed often ornamented with feathers.'),
(11362, 'Calumny', 'n.', 'False accusation of a crime or offense, maliciously made\n   or reported, to the injury of another; malicious misrepresentation;\n   slander; detraction.'),
(11363, 'Calvaria', 'n.', 'The bones of the cranium; more especially, the bones of\n   the domelike upper portion.'),
(11364, 'Calvary', 'n.', 'The place where Christ was crucified, on a small hill\n   outside of Jerusalem.'),
(11365, 'Calvary', 'n.', 'A representation of the crucifixion, consisting of three\n   crosses with the figures of Christ and the thieves, often as large as\n   life, and sometimes surrounded by figures of other personages who were\n   present at the crucifixion.'),
(11366, 'Calvary', 'n.', 'A cross, set upon three steps; -- more properly called\n   cross calvary.'),
(11367, 'Calved', 'imp. & p. p.', 'of Calve'),
(11368, 'Calving', 'p. pr. & vb. n.', 'of Calve'),
(11369, 'Calve', 'v. i.', 'To bring forth a calf.'),
(11370, 'Calve', 'v. i.', 'To bring forth young; to produce offspring.'),
(11371, 'Calver', 'v. i.', 'To cut in slices and pickle, as salmon.'),
(11372, 'Calver', 'v. i.', 'To crimp; as, calvered salmon.'),
(11373, 'Calver', 'v. i.', 'To bear, or be susceptible of, being calvered; as,\n   grayling\'s flesh will calver.'),
(11374, 'Calvish', 'a.', 'Like a calf; stupid.'),
(11375, 'Calxes', 'pl. ', 'of Calx'),
(11376, 'Calces', 'pl. ', 'of Calx'),
(11377, 'Calycine', 'a.', 'Pertaining to a calyx; having the nature of a calyx.'),
(11378, 'Calycle', 'n.', 'A row of small bracts, at the base of the calyx, on the\n   outside.'),
(11379, 'Calycled', 'a.', 'Calyculate.'),
(11380, 'Calymene', 'n.', 'A genus of trilobites characteristic of the Silurian age.'),
(11381, 'Calyon', 'n.', 'Flint or pebble stone, used in building walls, etc.'),
(11382, 'Calypso', 'n.', 'A small and beautiful species of orchid, having a flower\n   variegated with purple, pink, and yellow. It grows in cold and wet\n   localities in the northern part of the United States. The Calypso\n   borealis is the only orchid which reaches 68¡ N.'),
(11383, 'Calyptra', 'n.', 'A little hood or veil, resembling an extinguisher in form\n   and position, covering each of the small flasklike capsules which\n   contain the spores of mosses; also, any similar covering body.'),
(11384, 'Calyxes', 'pl. ', 'of Calyx'),
(11385, 'Calyces', 'pl. ', 'of Calyx'),
(11386, 'Calyx', 'n.', 'The covering of a flower. See Flower.'),
(11387, 'Calyx', 'n.', 'A cuplike division of the pelvis of the kidney, which\n   surrounds one or more of the renal papillae.'),
(11388, 'Calzoons', 'n. pl.', 'Drawers.'),
(11389, 'Camaieu', 'n.', 'A cameo.'),
(11390, 'Camaieu', 'n.', 'Painting in shades of one color; monochrome.'),
(11391, 'Camail', 'n.', 'A neck guard of chain mall, hanging from the bascinet or\n   other headpiece.'),
(11392, 'Camail', 'n.', 'A hood of other material than mail;'),
(11393, 'Camail', 'n.', 'a hood worn in church services, -- the amice, or the like.'),
(11394, 'Camass', 'n.', 'A blue-flowered liliaceous plant (Camassia esculenta) of\n   northwestern America, the bulbs of which are collected for food by the\n   Indians.'),
(11395, 'Camber', 'n.', 'An upward convexity of a deck or other surface; as, she has\n   a high camber (said of a vessel having an unusual convexity of deck).'),
(11396, 'Camber', 'n.', 'An upward concavity in the under side of a beam, girder, or\n   lintel; also, a slight upward concavity in a straight arch. See\n   Hogback.'),
(11397, 'Cambered', 'imp. & p. p.', 'of Camber'),
(11398, 'Camber', 'v. t.', 'To cut bend to an upward curve; to construct, as a deck,\n   with an upward curve.'),
(11399, 'Camber', 'v. i.', 'To curve upward.'),
(11400, 'Cambial', 'a.', 'Belonging to exchanges in commerce; of exchange.'),
(11401, 'Cambist', 'n.', 'A banker; a money changer or broker; one who deals in\n   bills of exchange, or who is skilled in the science of exchange.'),
(11402, 'Cambium', 'n.', 'A series of formative cells lying outside of the wood\n   proper and inside of the inner bark. The growth of new wood takes place\n   in the cambium, which is very soft.'),
(11403, 'Cambium', 'n.', 'A fancied nutritive juice, formerly supposed to originate\n   in the blood, to repair losses of the system, and to promote its\n   increase.'),
(11404, 'Camblet', 'n.', 'See Camlet.'),
(11405, 'Camboge', 'n.', 'See Gamboge.'),
(11406, 'Camboose', 'n.', 'See Caboose.'),
(11407, 'Cambrel', 'n.', 'See Gambrel, n., 2.'),
(11408, 'Cambria', 'n.', 'The ancient Latin name of Wales. It is used by modern\n   poets.'),
(11409, 'Cambrian', 'a.', 'Of or pertaining to Cambria or Wales.'),
(11410, 'Cambrian', 'a.', 'Of or pertaining to the lowest subdivision of the rocks\n   of the Silurian or Molluscan age; -- sometimes described as inferior to\n   the Silurian. It is named from its development in Cambria or Wales. See\n   the Diagram under Geology.'),
(11411, 'Cambrian', 'n.', 'A native of Cambria or Wales.'),
(11412, 'Cambrian', 'n.', 'The Cambrian formation.'),
(11413, 'Cambric', 'n.', 'A fine, thin, and white fabric made of flax or linen.'),
(11414, 'Cambric', 'n.', 'A fabric made, in imitation of linen cambric, of fine,\n   hardspun cotton, often with figures of various colors; -- also called\n   cotton cambric, and cambric muslin.'),
(11415, 'Camel', 'n.', 'A large ruminant used in Asia and Africa for carrying\n   burdens and for riding. The camel is remarkable for its ability to go a\n   long time without drinking. Its hoofs are small, and situated at the\n   extremities of the toes, and the weight of the animal rests on the\n   callous. The dromedary (Camelus dromedarius) has one bunch on the back,\n   while the Bactrian camel (C. Bactrianus) has two. The llama, alpaca,\n   and vicua, of South America, belong to a related genus (Auchenia).'),
(11416, 'Camel', 'n.', 'A water-tight structure (as a large box or boxes) used to\n   assist a vessel in passing over a shoal or bar or in navigating shallow\n   water. By admitting water, the camel or camels may be sunk and attached\n   beneath or at the sides of a vessel, and when the water is pumped out\n   the vessel is lifted.'),
(11417, 'Cameleon', 'n.', 'See Chaceleon.'),
(11418, 'Camellia', 'n.', 'An Asiatic genus of small shrubs, often with shining\n   leaves and showy flowers. Camellia Japonica is much cultivated for\n   ornament, and C. Sassanqua and C. oleifera are grown in China for the\n   oil which is pressed from their seeds. The tea plant is now referred to\n   this genus under the name of Camellia Thea.'),
(11419, 'Camelot', 'n.', 'See Camelet.'),
(11420, 'Cameos', 'pl. ', 'of Cameo'),
(11421, 'Cameo', 'n.', 'A carving in relief, esp. one on a small scale used as a\n   jewel for personal adornment, or like.'),
(11422, 'Cameras', 'pl. ', 'of Camera'),
(11423, 'Camerae', 'pl. ', 'of Camera'),
(11424, 'Camera', 'n.', 'A chamber, or instrument having a chamber. Specifically:\n   The camera obscura when used in photography. See Camera, and Camera\n   obscura.'),
(11425, 'Camerade', 'n.', 'See Comrade.'),
(11426, 'Camerate', 'v. i.', 'To build in the form of a vault; to arch over.'),
(11427, 'Camerate', 'v. i.', 'To divide into chambers.'),
(11428, 'Camis', 'n.', 'A light, loose dress or robe.'),
(11429, 'Camisade', 'n.', 'Alt. of Camisado'),
(11430, 'Camisado', 'n.', 'A shirt worn by soldiers over their uniform, in order to\n   be able to recognize one another in a night attack.'),
(11431, 'Camisado', 'n.', 'An attack by surprise by soldiers wearing the camisado.'),
(11432, 'Camisard', 'n.', 'One of the French Protestant insurgents who rebelled\n   against Louis XIV, after the revocation of the edict of Nates; -- so\n   called from the peasant\'s smock (camise) which they wore.'),
(11433, 'Camisole', 'n.', 'A short dressing jacket for women.'),
(11434, 'Camisole', 'n.', 'A kind of straitjacket.'),
(11435, 'Camlet', 'n.', 'A woven fabric originally made of camel\'s hair, now chiefly\n   of goat\'s hair and silk, or of wool and cotton.'),
(11436, 'Camleted', 'a.', 'Wavy or undulating like camlet; veined.'),
(11437, 'Cammas', 'n.', 'See Camass.'),
(11438, 'Cammock', 'n.', 'A plant having long hard, crooked roots, the Ononis\n   spinosa; -- called also rest-harrow. The Scandix Pecten-Veneris is also\n   called cammock.'),
(11439, 'Camomile', 'n.', 'Alt. of Chamomile'),
