(11446, 'Campagna', 'n.', 'An open level tract of country; especially \"Campagna di\n   Roma.\" The extensive undulating plain which surrounds Rome.'),
(11447, 'Campaign', 'n.', 'An open field; a large, open plain without considerable\n   hills. SeeChampaign.'),
(11448, 'Campaign', 'n.', 'A connected series of military operations forming a\n   distinct stage in a war; the time during which an army keeps the field.'),
(11449, 'Campaign', 'n.', 'Political operations preceding an election; a canvass.'),
(11450, 'Campaign', 'n.', 'The period during which a blast furnace is continuously\n   in operation.'),
