(11456, 'Campanes', 'n. pl.', 'Bells.'),
(11457, 'Campania', 'n.', 'Open country.'),
(11458, 'Camper', 'n.', 'One who lodges temporarily in a hut or camp.'),
(11459, 'Camphene', 'n.', 'One of a series of substances C10H16, resembling camphor,\n   regarded as modified terpenes.'),
(11460, 'Camphine', 'n.', 'Rectified oil of turpentine, used for burning in lamps,\n   and as a common solvent in varnishes.'),
(11461, 'Camphire', 'n.', 'An old spelling of Camphor.'),
(11462, 'Camphol', 'n.', 'See Borneol.'),
(11463, 'Camphor', 'n.', 'A tough, white, aromatic resin, or gum, obtained from\n   different species of the Laurus family, esp. from Cinnamomum camphara\n   (the Laurus camphara of Linnaeus.). Camphor, C10H16O, is volatile and\n   fragrant, and is used in medicine as a diaphoretic, a stimulant, or\n   sedative.'),
(11464, 'Camphor', 'n.', 'A gum resembling ordinary camphor, obtained from a tree\n   (Dryobalanops camphora) growing in Sumatra and Borneo; -- called also\n   Malay camphor, camphor of Borneo, or borneol. See Borneol.'),
(11465, 'Camphor', 'v. t.', 'To impregnate or wash with camphor; to camphorate.'),
(11466, 'Camping', 'n.', 'Lodging in a camp.'),
(11467, 'Camping', 'n.', 'A game of football.'),
(11468, 'Campion', 'n.', 'A plant of the Pink family (Cucubalus bacciferus), bearing\n   berries regarded as poisonous.'),
(11469, 'Campus', 'n.', 'The principal grounds of a college or school, between the\n   buildings or within the main inclosure; as, the college campus.'),
(11470, 'Camus', 'n.', 'See Camis.'),
(11471, 'Camwood', 'n.', 'See Barwood.'),
