(11506, 'Cancelli', 'v. t.', 'An interwoven or latticed wall or inclosure;\n   latticework, rails, or crossbars, as around the bar of a court of\n   justice, between the chancel and the nave of a church, or in a window.'),
(11507, 'Cancelli', 'v. t.', 'The interlacing osseous plates constituting the\n   elastic porous tissue of certain parts of the bones, esp. in their\n   articular extremities.'),
(11508, 'Cancer', 'n.', 'A genus of decapod Crustacea, including some of the most\n   common shore crabs of Europe and North America, as the rock crab, Jonah\n   crab, etc. See Crab.'),
(11509, 'Cancer', 'n.', 'The fourth of the twelve signs of the zodiac. The first\n   point is the northern limit of the sun\'s course in summer; hence, the\n   sign of the summer solstice. See Tropic.'),
(11510, 'Cancer', 'n.', 'A northern constellation between Gemini and Leo.'),
(11511, 'Cancer', 'n.', 'Formerly, any malignant growth, esp. one attended with\n   great pain and ulceration, with cachexia and progressive emaciation. It\n   was so called, perhaps, from the great veins which surround it,\n   compared by the ancients to the claws of a crab. The term is now\n   restricted to such a growth made up of aggregations of epithelial\n   cells, either without support or embedded in the meshes of a trabecular\n   framework.'),
(11512, 'Cancrine', 'a.', 'Having the qualities of a crab; crablike.'),
(11513, 'Cancroid', 'a.', 'Resembling a crab; pertaining to the Cancroidea, one of\n   the families of crabs, including the genus Cancer.'),
(11514, 'Cancroid', 'a.', 'Like a cancer; as, a cancroid tumor.'),
(11515, 'Candent', 'a.', 'Heated to whiteness; glowing with heat.'),
(11516, 'Canderos', 'n.', 'An East Indian resin, of a pellucid white color, from\n   which small ornaments and toys are sometimes made.'),
(11517, 'Candid', 'a.', 'White.'),
(11518, 'Candid', 'a.', 'Free from undue bias; disposed to think and judge according\n   to truth and justice, or without partiality or prejudice; fair; just;\n   impartial; as, a candid opinion.'),
(11519, 'Candid', 'a.', 'Open; frank; ingenuous; outspoken.'),
(11520, 'Candidly', 'adv.', 'In a candid manner.'),
(11521, 'Candied', 'a.', 'Preserved in or with sugar; incrusted with a candylike\n   substance; as, candied fruits.'),
(11522, 'Candied', 'a.', 'Converted wholly or partially into sugar or candy; as\n   candied sirup.'),
(11523, 'Candied', 'a.', 'Conted or more or less with sugar; as, candidied raisins'),
(11524, 'Candied', 'a.', 'Figuratively; Honeyed; sweet; flattering.'),
