(11529, 'Candle', 'n.', 'A slender, cylindrical body of tallow, containing a wick\n   composed of loosely twisted linen of cotton threads, and used to\n   furnish light.'),
(11530, 'Candle', 'n.', 'That which gives light; a luminary.'),
(11531, 'Candock', 'n.', 'A plant or weed that grows in rivers; a species of\n   Equisetum; also, the yellow frog lily (Nuphar luteum).'),
(11532, 'Candor', 'n.', 'Whiteness; brightness; (as applied to moral conditions)\n   usullied purity; innocence.'),
