(11538, 'Candy', 'v. t.', 'To make sugar crystals of or in; to form into a mass\n   resembling candy; as, to candy sirup.'),
(11539, 'Candy', 'v. t.', 'To incrust with sugar or with candy, or with that which\n   resembles sugar or candy.'),
(11540, 'Candy', 'v. i.', 'To have sugar crystals form in or on; as, fruits\n   preserved in sugar candy after a time.'),
(11541, 'Candy', 'v. i.', 'To be formed into candy; to solidify in a candylike form\n   or mass.'),
(11542, 'Candy', 'v. t.', 'A more or less solid article of confectionery made by\n   boiling sugar or molasses to the desired consistency, and than\n   crystallizing, molding, or working in the required shape. It is often\n   flavored or colored, and sometimes contains fruit, nuts, etc.'),
(11543, 'Candy', 'n.', 'A weight, at Madras 500 pounds, at Bombay 560 pounds.'),
(11544, 'Caned', 'imp. & p. p.', 'of Cane'),
(11545, 'Caning', 'p. pr. & vb. n.', 'of Cane'),
(11546, 'Caned', 'a.', 'Filled with white flakes; mothery; -- said vinegar when\n   containing mother.'),
(11547, 'Canella', 'n.', 'A genus of trees of the order Canellaceae, growing in the\n   West Indies.'),
(11548, 'Can hook', '', 'A device consisting of a short rope with flat hooks at each\n   end, for hoisting casks or barrels by the ends of the staves.'),
(11549, 'Canicule', 'n.', 'Canicula.'),
(11550, 'Caninal', 'a.', 'See Canine, a.'),
(11551, 'Canine', 'a.', 'Of or pertaining to the family Canidae, or dogs and wolves;\n   having the nature or qualities of a dog; like that or those of a dog.'),
