(11561, 'Canker', 'n.', 'A disease incident to trees, causing the bark to rot and\n   fall off.'),
(11562, 'Canker', 'n.', 'An obstinate and often incurable disease of a horse\'s foot,\n   characterized by separation of the horny portion and the development of\n   fungoid growths; -- usually resulting from neglected thrush.'),
