(11598, 'Cannei', 'a.', 'Reputed to have magical powers.'),
(11599, 'Canoes', 'pl. ', 'of Canoe'),
(11600, 'Canoe', 'n.', 'A boat used by rude nations, formed of trunk of a tree,\n   excavated, by cutting of burning, into a suitable shape. It is\n   propelled by a paddle or paddles, or sometimes by sail, and has no\n   rudder.'),
(11601, 'Canoe', 'n.', 'A boat made of bark or skins, used by savages.'),
(11602, 'Canoe', 'n.', 'A light pleasure boat, especially designed for use by one\n   who goes alone upon long excursions, including portage. It it propelled\n   by a paddle, or by a small sail attached to a temporary mast.'),
(11603, 'Canoed', 'imp. & p. p.', 'of Canoe'),
(11604, 'Canoeing', 'p. pr. & vb. n.', 'of Canoe'),
(11605, 'Canoe', 'v. i.', 'To manage a canoe, or voyage in a canoe.'),
(11606, 'Canoeing', 'n.', 'The act or art of using a canoe.'),
