(11608, 'Canoemen', 'pl. ', 'of Canoeman'),
(11609, 'Canoeman', 'n.', 'One who uses a canoe; one who travels in a canoe.'),
(11610, 'Canon', 'n.', 'A law or rule.'),
(11611, 'Canon', 'n.', 'A law, or rule of doctrine or discipline, enacted by a\n   council and confirmed by the pope or the sovereign; a decision,\n   regulation, code, or constitution made by ecclesiastical authority.'),
(11612, 'Canon', 'n.', 'The collection of books received as genuine Holy Scriptures,\n   called the sacred canon, or general rule of moral and religious duty,\n   given by inspiration; the Bible; also, any one of the canonical\n   Scriptures. See Canonical books, under Canonical, a.'),
(11613, 'Canon', 'n.', 'In monasteries, a book containing the rules of a religious\n   order.'),
(11614, 'Canon', 'n.', 'A catalogue of saints acknowledged and canonized in the\n   Roman Catholic Church.'),
(11615, 'Canon', 'n.', 'A member of a cathedral chapter; a person who possesses a\n   prebend in a cathedral or collegiate church.'),
(11616, 'Canon', 'n.', 'A musical composition in which the voices begin one after\n   another, at regular intervals, successively taking up the same subject.\n   It either winds up with a coda (tailpiece), or, as each voice finishes,\n   commences anew, thus forming a perpetual fugue or round. It is the\n   strictest form of imitation. See Imitation.'),
(11617, 'Canon', 'n.', 'The largest size of type having a specific name; -- so\n   called from having been used for printing the canons of the church.'),
(11618, 'Canon', 'n.', 'The part of a bell by which it is suspended; -- called also\n   ear and shank.'),
(11619, 'Canon', 'n.', 'See Carom.'),
(11620, 'Canoness', 'n.', 'A woman who holds a canonry in a conventual chapter.'),
(11621, 'Canonic', 'a.', 'Alt. of Cannonical'),
(11622, 'Canonist', 'n.', 'A professor of canon law; one skilled in the knowledge\n   and practice of ecclesiastical law.'),
(11623, 'Canonize', 'v. t.', 'To declare (a deceased person) a saint; to put in the\n   catalogue of saints; as, Thomas a Becket was canonized.'),
(11624, 'Canonize', 'v. t.', 'To glorify; to exalt to the highest honor.'),
(11625, 'Canonize', 'v. t.', 'To rate as inspired; to include in the canon.'),
(11626, 'Canonry', 'n. pl.', 'A benefice or prebend in a cathedral or collegiate\n   church; a right to a place in chapter and to a portion of its revenues;\n   the dignity or emoluments of a canon.'),
(11627, 'Canopus', 'n.', 'A star of the first magnitude in the southern\n   constellation Argo.'),
(11628, 'Canopies', 'pl. ', 'of Canopy'),
(11629, 'Canopy', 'n.', 'A covering fixed over a bed, dais, or the like, or carried\n   on poles over an exalted personage or a sacred object, etc. chiefly as\n   a mark of honor.'),
(11630, 'Canopy', 'n.', 'An ornamental projection, over a door, window, niche, etc.'),
(11631, 'Canopy', 'n.', 'Also, a rooflike covering, supported on pillars over an\n   altar, a statue, a fountain, etc.'),
(11632, 'Canopes', 'imp. & p. p.', 'of Canopy'),
(11633, 'Canopy', 'v. t.', 'To cover with, or as with, a canopy.'),
(11634, 'Canorous', 'a.', 'Melodious; musical.'),
