(11638, 'Cantab', 'n.', 'A Cantabrigian.'),
(11639, 'Cantar', 'n.', 'Alt. of Cantarro'),
(11640, 'Cantarro', 'n.', 'A weight used in southern Europe and East for heavy\n   articles. It varies in different localities; thus, at Rome it is nearly\n   75 pounds, in Sardinia nearly 94 pounds, in Cairo it is 95 pounds, in\n   Syria about 503 pounds.'),
(11641, 'Cantarro', 'n.', 'A liquid measure in Spain, ranging from two and a half to\n   four gallons.'),
(11642, 'Cantata', 'n.', 'A poem set to music; a musical composition comprising\n   choruses, solos, interludes, etc., arranged in a somewhat dramatic\n   manner; originally, a composition for a single noise, consisting of\n   both recitative and melody.'),
(11643, 'Canted', 'a.', 'Having angles; as, a six canted bolt head; a canted window.'),
(11644, 'Canted', 'a.', 'Inclined at an angle to something else; tipped; sloping.'),
(11645, 'Canteen', 'n.', 'A vessel used by soldiers for carrying water, liquor, or\n   other drink.'),
(11646, 'Canteen', 'n.', 'The sutler\'s shop in a garrison; also, a chest containing\n   culinary and other vessels for officers.'),
(11647, 'Cantel', 'n.', 'See Cantle.'),
(11648, 'Canter', 'n.', 'A moderate and easy gallop adapted to pleasure riding.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(11649, 'Canter', 'n.', 'A rapid or easy passing over.'),
(11650, 'Cantered', 'imp. & p. p.', 'of Canter'),
(11651, 'Canter', 'v. i.', 'To move in a canter.'),
(11652, 'Canter', 'v. t.', 'To cause, as a horse, to go at a canter; to ride (a\n   horse) at a canter.'),
(11653, 'Canter', 'n.', 'One who cants or whines; a beggar.'),
(11654, 'Canter', 'n.', 'One who makes hypocritical pretensions to goodness; one who\n   uses canting language.'),
(11655, 'Canthi', 'pl. ', 'of Canthus'),
(11656, 'Canthus', 'n.', 'The corner where the upper and under eyelids meet on each\n   side of the eye.'),
(11657, 'Canticle', 'n.', 'A song; esp. a little song or hymn.'),
(11658, 'Canticle', 'n.', 'The Song of Songs or Song of Solomon, one of the books of\n   the Old Testament.'),
(11659, 'Canticle', 'n.', 'A canto or division of a poem'),
(11660, 'Canticle', 'n.', 'A psalm, hymn, or passage from the Bible, arranged for\n   chanting in church service.'),
(11661, 'Canticoy', 'n.', 'A social gathering; usually, one for dancing.'),
(11662, 'Cantile', 'v. i.', 'Same as Cantle, v. t.'),
(11663, 'Cantine', 'n.', 'See Canteen.'),
(11664, 'Canting', 'a.', 'Speaking in a whining tone of voice; using technical or\n   religious terms affectedly; affectedly pious; as, a canting rogue; a\n   canting tone.'),
(11665, 'Canting', 'n.', 'The use of cant; hypocrisy.'),
(11666, 'Cantion', 'n.', 'A song or verses.'),
(11667, 'Cantle', 'n.', 'A corner or edge of anything; a piece; a fragment; a part.'),
(11668, 'Cantle', 'n.', 'The upwardly projecting rear part of saddle, opposite to\n   the pommel.'),
(11669, 'Cantle', 'v. t.', 'To cut in pieces; to cut out from.'),
(11670, 'Cantlet', 'n.', 'A piece; a fragment; a corner.'),
(11671, 'Cantos', 'pl. ', 'of Canto'),
(11672, 'Canto', 'n.', 'One of the chief divisions of a long poem; a book.'),
(11673, 'Canto', 'n.', 'The highest vocal part; the air or melody in choral music;\n   anciently the tenor, now the soprano.'),
(11674, 'Canton', 'n.', 'A song or canto'),
(11675, 'Canton', 'n.', 'A small portion; a division; a compartment.'),
(11676, 'Canton', 'n.', 'A small community or clan.'),
(11677, 'Canton', 'n.', 'A small territorial district; esp. one of the twenty-two\n   independent states which form the Swiss federal republic; in France, a\n   subdivision of an arrondissement. See Arrondissement.'),
(11678, 'Canton', 'n.', 'A division of a shield occupying one third part of the\n   chief, usually on the dexter side, formed by a perpendicular line from\n   the top of the shield, meeting a horizontal line from the side.'),
(11679, 'Cantoned', 'imp. & p. p.', 'of Canton'),
(11680, 'Canton', 'v. i.', 'To divide into small parts or districts; to mark off or\n   separate, as a distinct portion or division.'),
(11681, 'Canton', 'v. i.', 'To allot separate quarters to, as to different parts or\n   divisions of an army or body of troops.'),
(11682, 'Cantonal', 'a.', 'Of or pertaining to a canton or cantons; of the nature of\n   a canton.'),
(11683, 'Cantoned', 'a.', 'Having a charge in each of the four corners; -- said of a\n   cross on a shield, and also of the shield itself.'),
(11684, 'Cantoned', 'a.', 'Having the angles marked by, or decorated with,\n   projecting moldings or small columns; as, a cantoned pier or pilaster.'),
(11685, 'Cantoon', 'n.', 'A cotton stuff showing a fine cord on one side and a\n   satiny surface on the other.'),
(11686, 'Cantor', 'n.', 'A singer; esp. the leader of a church choir; a precentor.'),
(11687, 'Cantoral', 'a.', 'Of or belonging to a cantor.'),
(11688, 'Cantoris', 'a.', 'Of or pertaining to a cantor; as, the cantoris side of a\n   choir; a cantoris stall.'),
(11689, 'Cantrap', 'n.', 'Alt. of Cantrip'),
(11690, 'Cantrip', 'n.', 'A charm; an incantation; a shell; a trick; adroit\n   mischief.'),
(11691, 'Cantred', 'n.', 'Alt. of Cantref'),
(11692, 'Cantref', 'n.', 'A district comprising a hundred villages, as in Wales.'),
(11693, 'Canty', 'a.', 'Cheerful; sprightly; lively; merry.'),
(11694, 'Canuck', 'n.', 'A Canadian.'),
(11695, 'Canuck', 'n.', 'A small or medium-sized hardy horse, common in Canada.'),
(11696, 'Canula', 'a.', 'Alt. of Canulated'),
(11697, 'Canular', 'a.', 'Alt. of Canulated'),
(11698, 'Canvas', 'n.', 'A strong cloth made of hemp, flax, or cotton; -- used for\n   tents, sails, etc.'),
(11699, 'Canvas', 'n.', 'A coarse cloth so woven as to form regular meshes for\n   working with the needle, as in tapestry, or worsted work.'),
(11700, 'Canvas', 'n.', 'A piece of strong cloth of which the surface has been\n   prepared to receive painting, commonly painting in oil.'),
(11701, 'Canvas', 'n.', 'Something for which canvas is used: (a) A sail, or a\n   collection of sails. (b) A tent, or a collection of tents. (c) A\n   painting, or a picture on canvas.'),
(11702, 'Canvas', 'n.', 'A rough draft or model of a song, air, or other literary or\n   musical composition; esp. one to show a poet the measure of the verses\n   he is to make.'),
(11703, 'Canvas', 'a.', 'Made of, pertaining to, or resembling, canvas or coarse\n   cloth; as, a canvas tent.'),
(11704, 'Canvass', 'n.', 'To sift; to strain; to examine thoroughly; to scrutinize;\n   as, to canvass the votes cast at an election; to canvass a district\n   with reference to its probable vote.'),
(11705, 'Canvass', 'n.', 'To examine by discussion; to debate.'),
(11706, 'Canvass', 'n.', 'To go trough, with personal solicitation or public\n   addresses; as, to canvass a district for votes; to canvass a city for\n   subscriptions.'),
(11707, 'Canvass', 'v. i.', 'To search thoroughly; to engage in solicitation by\n   traversing a district; as, to canvass for subscriptions or for votes;\n   to canvass for a book, a publisher, or in behalf of a charity; --\n   commonly followed by for.'),
(11708, 'Canvass', 'n.', 'Close inspection; careful review for verification; as, a\n   canvass of votes.'),
(11709, 'Canvass', 'n.', 'Examination in the way of discussion or debate.'),
(11710, 'Canvass', 'n.', 'Search; exploration; solicitation; systematic effort to\n   obtain votes, subscribers, etc.'),
(11711, 'Canyon', 'n.', 'The English form of the Spanish word Caon.'),
(11712, 'Canzone', 'n.', 'A song or air for one or more voices, of Provencal origin,\n   resembling, though not strictly, the madrigal.'),
(11713, 'Canzone', 'n.', 'An instrumental piece in the madrigal style.'),
(11714, 'Canzonet', 'n.', 'A short song, in one or more parts.'),
(11715, 'Capped', 'imp. & p. p.', 'of Cap'),
(11716, 'Capping', 'p. pr. & vb. n.', 'of Cap'),
(11717, 'Capable', 'a.', 'Possessing ability, qualification, or susceptibility;\n   having capacity; of sufficient size or strength; as, a room capable of\n   holding a large number; a castle capable of resisting a long assault.'),
(11718, 'Capable', 'a.', 'Possessing adequate power; qualified; able; fully\n   competent; as, a capable instructor; a capable judge; a mind capable of\n   nice investigations.'),
(11719, 'Capable', 'a.', 'Possessing legal power or capacity; as, a man capable of\n   making a contract, or a will.'),
(11720, 'Capable', 'a.', 'Capacious; large; comprehensive.'),
(11721, 'Capacify', 'v. t.', 'To quality.'),
(11722, 'Capacity', 'n.', 'The power of receiving or containing; extent of room or\n   space; passive power; -- used in reference to physical things.'),
(11723, 'Capacity', 'n.', 'The power of receiving and holding ideas, knowledge,\n   etc.; the comprehensiveness of the mind; the receptive faculty;\n   capability of undestanding or feeling.'),
(11724, 'Capacity', 'n.', 'Ability; power pertaining to, or resulting from, the\n   possession of strength, wealth, or talent; possibility of being or of\n   doing.'),
(11725, 'Capacity', 'n.', 'Outward condition or circumstances; occupation;\n   profession; character; position; as, to work in the capacity of a mason\n   or a carpenter.'),
(11726, 'Capacity', 'n.', 'Legal or noral qualification, as of age, residence,\n   character, etc., necessary for certain purposes, as for holding office,\n   for marrying, for making contracts, will, etc.; legal power or right;\n   competency.'),
(11727, 'Capape', 'adv.', 'See Cap-a-pie.'),
(11728, 'Capapie', 'adv.', 'From head to foot; at all points.'),
(11729, 'Caparro', 'n.', 'A large South American monkey (Lagothrix Humboldtii), with\n   prehensile tail.'),
(11730, 'Capcase', 'n.', 'A small traveling case or bandbox; formerly, a chest.'),
(11731, 'Capel', 'n.', 'Alt. of Caple'),
(11732, 'Caple', 'n.', 'A horse; a nag.'),
(11733, 'Capel', 'n.', 'A composite stone (quartz, schorl, and hornblende) in the\n   walls of tin and copper lodes.'),
(11734, 'Capelan', 'n.', 'See Capelin.'),
(11735, 'Capelin', 'n.', 'A small marine fish (Mallotus villosus) of the family\n   Salmonidae, very abundant on the coasts of Greenland, Iceland,\n   Newfoundland, and Alaska. It is used as a bait for the cod.'),
(11736, 'Capella', 'n.', 'A brilliant star in the constellation Auriga.'),
(11737, 'Capelle', 'n.', 'The private orchestra or band of a prince or of a church.'),
(11738, 'Capellet', 'n.', 'A swelling, like a wen, on the point of the elbow (or the\n   heel of the hock) of a horse, caused probably by bruises in lying down.'),
(11739, 'Capered', 'imp. & p. p.', 'of Caper'),
(11740, 'Capering', 'p. pr. & vb. n.', 'of Caper'),
(11741, 'Caper', 'v. i.', 'To leap or jump about in a sprightly manner; to cut\n   capers; to skip; to spring; to prance; to dance.'),
(11742, 'Caper', 'n.', 'A frolicsome leap or spring; a skip; a jump, as in mirth or\n   dancing; a prank.'),
(11743, 'Caper', 'n.', 'A vessel formerly used by the Dutch, privateer.'),
(11744, 'Caper', 'n.', 'The pungent grayish green flower bud of the European and\n   Oriental caper (Capparis spinosa), much used for pickles.'),
(11745, 'Caper', 'n.', 'A plant of the genus Capparis; -- called also caper bush,\n   caper tree.'),
(11746, 'Caperer', 'n.', 'One who capers, leaps, and skips about, or dances.'),
(11747, 'Capful', 'n.', 'As much as will fill a cap.'),
(11748, 'Capias', 'n.', 'A writ or process commanding the officer to take the body\n   of the person named in it, that is, to arrest him; -- also called writ\n   of capias.'),
(11749, 'Capibara', 'n.', 'See Capybara.'),
(11750, 'Capital', 'n.', 'Of or pertaining to the head.'),
(11751, 'Capital', 'n.', 'Having reference to, or involving, the forfeiture of the\n   head or life; affecting life; punishable with death; as, capital\n   trials; capital punishment.'),
(11752, 'Capital', 'n.', 'First in importance; chief; principal.'),
(11753, 'Capital', 'n.', 'Chief, in a political sense, as being the seat of the\n   general government of a state or nation; as, Washington and Paris are\n   capital cities.'),
(11754, 'Capital', 'n.', 'Of first rate quality; excellent; as, a capital speech or\n   song.'),
(11755, 'Capital', 'n.', 'The head or uppermost member of a column, pilaster, etc.\n   It consists generally of three parts, abacus, bell (or vase), and\n   necking. See these terms, and Column.'),
(11756, 'Capital', 'n.', 'The seat of government; the chief city or town in a\n   country; a metropolis.'),
(11757, 'Capital', 'n.', 'Money, property, or stock employed in trade, manufactures,\n   etc.; the sum invested or lent, as distinguished from the income or\n   interest. See Capital stock, under Capital, a.'),
(11758, 'Capital', 'a.', 'That portion of the produce of industry, which may be\n   directly employed either to support human beings or to assist in\n   production.'),
(11759, 'Capital', 'a.', 'Anything which can be used to increase one\'s power or\n   influence.'),
(11760, 'Capital', 'a.', 'An imaginary line dividing a bastion, ravelin, or other\n   work, into two equal parts.'),
(11761, 'Capital', 'a.', 'A chapter, or section, of a book.'),
(11762, 'Capital', 'a.', 'See Capital letter, under Capital, a.'),
(11763, 'Pacha', '', 'The chief admiral of the Turkish fleet.'),
(11764, 'Capitate', 'a.', 'Headlike in form; also, having the distal end enlarged\n   and rounded, as the stigmas of certain flowers.'),
(11765, 'Capitate', 'a.', 'Having the flowers gathered into a head.'),
(11766, 'Capite', 'n.', 'See under Tenant.'),
(11767, 'Capitol', '', 'The temple of Jupiter, at Rome, on the Mona Capitolinus,\n   where the Senate met.'),
(11768, 'Capitol', '', 'The edifice at Washington occupied by the Congress of the\n   United States; also, the building in which the legislature of State\n   holds its sessions; a statehouse.'),
(11769, 'Capitula', 'n. pl.', 'See Capitulum.'),
(11770, 'Capitule', 'n.', 'A summary.'),
(11771, 'Capivi', 'n.', 'A balsam of the Spanish West Indies. See Copaiba.'),
(11772, 'Caple', 'n.', 'See Capel.'),
(11773, 'Caplin', 'n.', 'See Capelin.'),
(11774, 'Caplin', 'n.', 'Alt. of Capling'),
(11775, 'Capling', 'n.', 'The cap or coupling of a flail, through which the thongs\n   pass which connect the handle and swingel.'),
(11776, 'Capnomor', 'n.', 'A limpid, colorless oil with a peculiar odor, obtained\n   from beech tar.'),
(11777, 'Capoc', 'n.', 'A sort of cotton so short and fine that it can not be spun,\n   used in the East Indies to line palanquins, to make mattresses, etc.'),
(11778, 'Capoches', 'pl. ', 'of Capoch'),
(11779, 'Capoch', 'n.', 'A hood; especially, the hood attached to the gown of a\n   monk.'),
(11780, 'Capoched', 'imp. & p. p.', 'of Capoch'),
(11781, 'Capoch', 'v. t.', 'To cover with, or as with, a hood; hence, to hoodwink or\n   blind.'),
(11782, 'Capon', 'n.', 'A castrated cock, esp. when fattened; a male chicken gelded\n   to improve his flesh for the table.'),
(11783, 'Capon', 'v. t.', 'To castrate; to make a capon of.'),
(11784, 'Caponet', 'n.', 'A young capon.'),
(11785, 'Caponize', 'v. t.', 'To castrate, as a fowl.'),
(11786, 'Capot', 'n.', 'A winning of all the tricks at the game of piquet. It counts\n   for forty points.'),
(11787, 'Capotted', 'imp. & p. p.', 'of Capot'),
(11788, 'Capot', 'v. t.', 'To win all the tricks from, in playing at piquet.'),
(11789, 'Capote', 'n.', 'A long cloak or overcoat, especially one with a hood.'),
(11790, 'Capouch', 'n. & v. t.', 'Same as Capoch.'),
(11791, 'Cappaper', '', 'See cap, n., also Paper, n.'),
(11792, 'Cappeak', 'n.', 'The front piece of a cap; -- now more commonly called\n   visor.'),
(11793, 'Cappella', 'n.', 'See A cappella.'),
(11794, 'Capper', 'n.', 'One whose business is to make or sell caps.'),
(11795, 'Capper', 'n.', 'A by-bidder; a decoy for gamblers [Slang, U. S.].'),
(11796, 'Capper', 'n.', 'An instrument for applying a percussion cap to a gun or\n   cartridge.'),
(11797, 'Capra', 'n.', 'A genus of ruminants, including the common goat.'),
(11798, 'Caprate', 'n.', 'A salt of capric acid.'),
(11799, 'Capric', 'a.', 'Of or pertaining to capric acid or its derivatives.'),
(11800, 'Cariccio', 'n.', 'A piece in a free form, with frequent digressions from\n   the theme; a fantasia; -- often called caprice.'),
(11801, 'Cariccio', 'n.', 'A caprice; a freak; a fancy.'),
(11802, 'Caprice', 'v. i.', 'An abrupt change in feeling, opinion, or action,\n   proceeding from some whim or fancy; a freak; a notion.'),
(11803, 'Caprice', 'v. i.', 'See Capriccio.'),
(11804, 'Caprid', 'a.', 'Of or pertaining to the tribe of ruminants of which the\n   goat, or genus Capra, is the type.'),
(11805, 'Caprine', 'a.', 'Of or pertaining to a goat; as, caprine gambols.'),
(11806, 'Capriole', 'v. i.', 'A leap that a horse makes with all fours, upwards\n   only, without advancing, but with a kick or jerk of the hind legs when\n   at the height of the leap.'),
(11807, 'Capriole', 'v. i.', 'A leap or caper, as in dancing.'),
(11808, 'Capriole', 'v. i.', 'To perform a capriole.'),
(11809, 'Capriped', 'a.', 'Having feet like those of a goat.'),
(11810, 'Caproate', 'n.', 'A salt of caproic acid.'),
(11811, 'Caproic', 'a.', 'See under Capric.'),
(11812, 'Caprylic', 'a.', 'See under Capric.'),
(11813, 'Capsheaf', 'n.', 'The top sheaf of a stack of grain: (fig.) the crowning or\n   finishing part of a thing.'),
(11814, 'Capsicin', 'n.', 'A red liquid or soft resin extracted from various species\n   of capsicum.'),
(11815, 'Capsicum', 'n.', 'A genus of plants of many species, producing capsules or\n   dry berries of various forms, which have an exceedingly pungent, biting\n   taste, and when ground form the red or Cayenne pepper of commerce.'),
(11816, 'Capsized', 'imp. & p. p.', 'of Capsize'),
(11817, 'Capsize', 'v. t. & i.', 'To upset or overturn, as a vessel or other body.'),
(11818, 'Capsize', 'n.', 'An upset or overturn.'),
(11819, 'Capstan', 'n.', 'A vertical cleated drum or cylinder, revolving on an\n   upright spindle, and surmounted by a drumhead with sockets for bars or\n   levers. It is much used, especially on shipboard, for moving or raising\n   heavy weights or exerting great power by traction upon a rope or cable,\n   passing around the drum. It is operated either by steam power or by a\n   number of men walking around the capstan, each pushing on the end of a\n   lever fixed in its socket.'),
(11820, 'Capstone', 'n.', 'A fossil echinus of the genus Cannulus; -- so called from\n   its supposed resemblance to a cap.'),
(11821, 'Capsular', 'a.', 'Alt. of Capsulary'),
(11822, 'Capsule', 'n.', 'a dry fruit or pod which is made up of several parts or\n   carpels, and opens to discharge the seeds, as, the capsule of the\n   poppy, the flax, the lily, etc.'),
(11823, 'Capsule', 'n.', 'A small saucer of clay for roasting or melting samples of\n   ores, etc.; a scorifier.'),
(11824, 'Capsule', 'n.', 'a small, shallow, evaporating dish, usually of porcelain.'),
(11825, 'Capsule', 'n.', 'A small cylindrical or spherical gelatinous envelope in\n   which nauseous or acrid doses are inclosed to be swallowed.'),
(11826, 'Capsule', 'n.', 'A membranous sac containing fluid, or investing an organ\n   or joint; as, the capsule of the lens of the eye. Also, a capsulelike\n   organ.'),
(11827, 'Capsule', 'n.', 'A metallic seal or cover for closing a bottle.'),
(11828, 'Capsule', 'n.', 'A small cup or shell, as of metal, for a percussion cap,\n   cartridge, etc.'),
(11829, 'Captain', 'n.', 'A head, or chief officer'),
(11830, 'Captain', 'n.', 'The military officer who commands a company, troop, or\n   battery, or who has the rank entitling him to do so though he may be\n   employed on other service.'),
(11831, 'Captain', 'n.', 'An officer in the United States navy, next above a\n   commander and below a commodore, and ranking with a colonel in the\n   army.'),
(11832, 'Captain', 'n.', 'By courtesy, an officer actually commanding a vessel,\n   although not having the rank of captain.'),
(11833, 'Captain', 'n.', 'The master or commanding officer of a merchant vessel.'),
(11834, 'Captain', 'n.', 'One in charge of a portion of a ship\'s company; as, a\n   captain of a top, captain of a gun, etc.'),
(11835, 'Captain', 'n.', 'The foreman of a body of workmen.'),
(11836, 'Captain', 'n.', 'A person having authority over others acting in concert;\n   as, the captain of a boat\'s crew; the captain of a football team.'),
(11837, 'Captain', 'n.', 'A military leader; a warrior.'),
(11838, 'Captain', 'v. t.', 'To act as captain of; to lead.'),
(11839, 'Captain', 'a.', 'Chief; superior.'),
(11840, 'Caption', 'n.', 'A caviling; a sophism.'),
(11841, 'Caption', 'n.', 'The act of taking or arresting a person by judicial\n   process.'),
(11842, 'Caption', 'n.', 'That part of a legal instrument, as a commission,\n   indictment, etc., which shows where, when, and by what authority, it\n   was taken, found, or executed.'),
(11843, 'Caption', 'n.', 'The heading of a chapter, section, or page.'),
(11844, 'Captious', 'a.', 'Apt to catch at faults; disposed to find fault or to\n   cavil; eager to object; difficult to please.'),
(11845, 'Captious', 'a.', 'Fitted to harass, perplex, or insnare; insidious;\n   troublesome.'),
(11846, 'Captive', 'n.', 'A prisoner taken by force or stratagem, esp., by an enemy,\n   in war; one kept in bondage or in the power of another.'),
(11847, 'Captive', 'n.', 'One charmed or subdued by beaty, excellence, or affection;\n   one who is captivated.'),
(11848, 'Captive', 'a.', 'Made prisoner, especially in war; held in bondage or in\n   confinement.'),
(11849, 'Captive', 'a.', 'Subdued by love; charmed; captivated.'),
(11850, 'Captive', 'a.', 'Of or pertaining to bondage or confinement; serving to\n   confine; as, captive chains; captive hours.'),
(11851, 'Captived', 'imp. & p. p.', 'of Captive'),
(11852, 'Captive', 'v. t.', 'To take prisoner; to capture.'),
(11853, 'Captor', 'n.', 'One who captures any person or thing, as a prisoner or a\n   prize.'),
(11854, 'Capture', 'n.', 'The act of seizing by force, or getting possession of by\n   superior power or by stratagem; as, the capture of an enemy, a vessel,\n   or a criminal.'),
(11855, 'Capture', 'n.', 'The securing of an object of strife or desire, as by the\n   power of some attraction.'),
(11856, 'Capture', 'n.', 'The thing taken by force, surprise, or stratagem; a prize;\n   prey.'),
(11857, 'Captured', 'imp. & p. p.', 'of Capture'),
(11858, 'Capture', 'v. t.', 'To seize or take possession of by force, surprise, or\n   stratagem; to overcome and hold; to secure by effort.'),
(11859, 'Capuccio', 'n.', 'A capoch or hood.'),
(11860, 'Capuched', 'a.', 'Cover with, or as with, a hood.'),
(11861, 'Capuchin', 'n.', 'A Franciscan monk of the austere branch established in\n   1526 by Matteo di Baschi, distinguished by wearing the long pointed\n   cowl or capoch of St. Francis.'),
(11862, 'Capuchin', 'n.', 'A garment for women, consisting of a cloak and hood,\n   resembling, or supposed to resemble, that of capuchin monks.'),
(11863, 'Capuchin', 'n.', 'A long-tailed South American monkey (Cabus capucinus),\n   having the forehead naked and wrinkled, with the hair on the crown\n   reflexed and resembling a monk\'s cowl, the rest being of a grayish\n   white; -- called also capucine monkey, weeper, sajou, sapajou, and sai.'),
(11864, 'Capuchin', 'n.', 'Other species of Cabus, as C. fatuellus (the brown or\n   horned capucine.), C. albifrons (the cararara), and C. apella.'),
(11865, 'Capuchin', 'n.', 'A variety of the domestic pigeon having a hoodlike tuft\n   of feathers on the head and sides of the neck.'),
(11866, 'Capucine', 'n.', 'See Capuchin, 3.'),
(11867, 'Capulet', 'n.', 'Same as Capellet.'),
(11868, 'Capulin', 'n.', 'The Mexican cherry (Prunus Capollin).'),
(11869, 'Capita', 'pl. ', 'of Caput'),
(11870, 'Caput', 'n.', 'The head; also, a knoblike protuberance or capitulum.'),
(11871, 'Caput', 'n.', 'The top or superior part of a thing.'),
(11872, 'Caput', 'n.', 'The council or ruling body of the University of Cambridge\n   prior to the constitution of 1856.'),
(11873, 'Capybara', 'n.', 'A large South American rodent (Hydrochaerus capybara)\n   Living on the margins of lakes and rivers. It is the largest extant\n   rodent, being about three feet long, and half that in height. It\n   somewhat resembles the Guinea pig, to which it is related; -- called\n   also cabiai and water hog.'),
(11874, 'Carabid', 'a.', 'Of, pertaining to, or resembling, the genus Carbus or\n   family Carabidae.'),
(11875, 'Carabid', 'n.', 'One of the Carabidae, a family of active insectivorous\n   beetles.'),
(11876, 'Carabine', 'n.', 'A carbine.'),
(11877, 'Caraboid', 'a.', 'Like, or pertaining to the genus Carabus.'),
(11878, 'Carabus', 'n.', 'A genus of ground beetles, including numerous species.\n   They devour many injurious insects.'),
(11879, 'Carac', 'n.', 'See Carack.'),
(11880, 'Caracal', 'n.', 'A lynx (Felis, or Lynx, caracal.) It is a native of Africa\n   and Asia. Its ears are black externally, and tipped with long black\n   hairs.'),
(11881, 'Caracara', 'n.', 'A south American bird of several species and genera,\n   resembling both the eagles and the vultures. The caracaras act as\n   scavengers, and are also called carrion buzzards.'),
(11882, 'Carack', 'n.', 'A kind of large ship formerly used by the Spaniards and\n   Portuguese in the East India trade; a galleon.'),
(11883, 'Caracole', 'n.', 'A half turn which a horseman makes, either to the right\n   or the left.'),
(11884, 'Caracole', 'n.', 'A staircase in a spiral form.'),
(11885, 'Caracole', 'v. i.', 'To move in a caracole, or in caracoles; to wheel.'),
(11886, 'Caracoly', 'n.', 'An alloy of gold, silver, and copper, of which an\n   inferior quality of jewelry is made.'),
(11887, 'Caracore', 'n.', 'Alt. of Caracora'),
(11888, 'Caracora', 'n.', 'A light vessel or proa used by the people of Borneo,\n   etc., and by the Dutch in the East Indies.'),
(11889, 'Carafe', 'n.', 'A glass water bottle for the table or toilet; -- called\n   also croft.'),
(11890, 'Carageen', 'n.', 'Alt. of Caragheen'),
(11891, 'Caramel', 'n.', 'Burnt sugar; a brown or black porous substance obtained by\n   heating sugar. It is soluble in water, and is used for coloring\n   spirits, gravies, etc.'),
(11892, 'Caramel', 'n.', 'A kind of confectionery, usually a small cube or square of\n   tenacious paste, or candy, of varying composition and flavor.'),
(11893, 'Caranx', 'n.', 'A genus of fishes, common on the Atlantic coast, including\n   the yellow or golden mackerel.'),
(11894, 'Carapace', 'n.', 'The thick shell or shield which covers the back of the\n   tortoise, or turtle, the crab, and other crustaceous animals.'),
(11895, 'Carapato', 'n.', 'A south American tick of the genus Amblyomma. There are\n   several species, very troublesome to man and beast.'),
