(11897, 'Carat', 'n.', 'The weight by which precious stones and pearls are weighed.'),
(11898, 'Carat', 'n.', 'A twenty-fourth part; -- a term used in estimating the\n   proportionate fineness of gold.'),
(11899, 'Caravan', 'n.', 'A company of travelers, pilgrims, or merchants, organized\n   and equipped for a long journey, or marching or traveling together,\n   esp. through deserts and countries infested by robbers or hostile\n   tribes, as in Asia or Africa.'),
(11900, 'Caravan', 'n.', 'A large, covered wagon, or a train of such wagons, for\n   conveying wild beasts, etc., for exhibition; an itinerant show, as of\n   wild beasts.'),
(11901, 'Caravan', 'n.', 'A covered vehicle for carrying passengers or for moving\n   furniture, etc.; -- sometimes shorted into van.'),
(11902, 'Caravel', 'n.', 'A name given to several kinds of vessels.'),
(11903, 'Caravel', 'n.', 'The caravel of the 16th century was a small vessel with\n   broad bows, high, narrow poop, four masts, and lateen sails. Columbus\n   commanded three caravels on his great voyage.'),
(11904, 'Caravel', 'n.', 'A Portuguese vessel of 100 or 150 tons burden.'),
(11905, 'Caravel', 'n.', 'A small fishing boat used on the French coast.'),
(11906, 'Caravel', 'n.', 'A Turkish man-of-war.'),
(11907, 'Caraway', 'n.', 'A biennial plant of the Parsley family (Carum Carui). The\n   seeds have an aromatic smell, and a warm, pungent taste. They are used\n   in cookery and confectionery, and also in medicine as a carminative.'),
(11908, 'Caraway', 'n.', 'A cake or sweetmeat containing caraway seeds.'),
(11909, 'Carbamic', 'a.', 'Pertaining to an acid so called.'),
(11910, 'Carbanil', 'n.', 'A mobile liquid, CO.N.C6H5, of pungent odor. It is the\n   phenyl salt of isocyanic acid.'),
(11911, 'Carbazol', 'n.', 'A white crystallized substance, C12H8NH, derived from\n   aniline and other amines.'),
(11912, 'Carbide', 'n.', 'A binary compound of carbon with some other element or\n   radical, in which the carbon plays the part of a negative; -- formerly\n   termed carburet.'),
(11913, 'Carbine', 'n.', 'A short, light musket or rifle, esp. one used by mounted\n   soldiers or cavalry.'),
(11914, 'Carbinol', 'n.', 'Methyl alcohol, CH3OH; -- also, by extension, any one in\n   the homologous series of paraffine alcohols of which methyl alcohol is\n   the type.'),
(11915, 'Carbolic', 'a.', 'Pertaining to, or designating, an acid derived from coal\n   tar and other sources; as, carbolic acid (called also phenic acid, and\n   phenol). See Phenol.'),
(11916, 'Carbon', 'n.', 'An elementary substance, not metallic in its nature, which\n   is present in all organic compounds. Atomic weight 11.97. Symbol C. it\n   is combustible, and forms the base of lampblack and charcoal, and\n   enters largely into mineral coals. In its pure crystallized state it\n   constitutes the diamond, the hardest of known substances, occuring in\n   monometric crystals like the octahedron, etc. Another modification is\n   graphite, or blacklead, and in this it is soft, and occurs in hexagonal\n   prisms or tables. When united with oxygen it forms carbon dioxide,\n   commonly called carbonic acid, or carbonic oxide, according to the\n   proportions of the oxygen; when united with hydrogen, it forms various\n   compounds called hydrocarbons. Compare Diamond, and Graphite.'),
(11917, 'Carbone', 'v. t.', 'To broil. [Obs.] \"We had a calf\'s head carboned\".'),
(11918, 'Carbonic', 'a.', 'Of, pertaining to, or obtained from, carbon; as, carbonic\n   oxide.'),
(11919, 'Carbonyl', 'n.', 'The radical (CO)\'\', occuring, always combined, in many\n   compounds, as the aldehydes, the ketones, urea, carbonyl chloride, etc.'),
(11920, 'Carboxyl', 'n.', 'The complex radical, CO.OH, regarded as the essential and\n   characteristic constituent which all oxygen acids of carbon (as formic,\n   acetic, benzoic acids, etc.) have in common; -- called also oxatyl.'),
(11921, 'Carboy', 'n.', 'A large, globular glass bottle, esp. one of green glass,\n   inclosed in basket work or in a box, for protection; -- used commonly\n   for carrying corrosive liquids; as sulphuric acid, etc.'),
(11922, 'Carburet', 'n.', 'A carbide. See Carbide'),
(11923, 'Carburet', 'v. t.', 'To combine or to impregnate with carbon, as by passing\n   through or over a liquid hydrocarbon; to carbonize or carburize.'),
(11924, 'Carcajou', 'n.', 'The wolverene; -- also applied, but erroneously, to the\n   Canada lynx, and sometimes to the American badger. See Wolverene.'),
(11925, 'Carcanet', 'n.', 'A jeweled chain, necklace, or collar.'),
(11926, 'Carcase', 'n.', 'See Carcass.'),
(11927, 'Carcass', 'n.', 'A dead body, whether of man or beast; a corpse; now\n   commonly the dead body of a beast.'),
(11928, 'Carcass', 'n.', 'The living body; -- now commonly used in contempt or\n   ridicule.'),
(11929, 'Carcass', 'n.', 'The abandoned and decaying remains of some bulky and once\n   comely thing, as a ship; the skeleton, or the uncovered or unfinished\n   frame, of a thing.'),
(11930, 'Carcass', 'n.', 'A hollow case or shell, filled with combustibles, to be\n   thrown from a mortar or howitzer, to set fire to buldings, ships, etc.'),
(11931, 'Carceral', 'a.', 'Belonging to a prison.'),
