(12030, 'Carnary', 'n.', 'A vault or crypt in connection with a church, used as a\n   repository for human bones disintered from their original burial\n   places; a charnel house.'),
(12031, 'Carnate', 'a.', 'Invested with, or embodied in, flesh.'),
(12032, 'Carnauba', 'n.', 'The Brazilian wax palm. See Wax palm.'),
(12033, 'Carneous', 'a.', 'Consisting of, or like, flesh; carnous; fleshy.'),
