(12091, 'Carpet', 'n.', 'A smooth soft covering resembling or suggesting a carpet.'),
(12092, 'Carpeted', 'imp. & p. p.', 'of Carpet'),
(12093, 'Carpet', 'v. t.', 'To cover with, or as with, a carpet; to spread with\n   carpets; to furnish with a carpet or carpets.'),
(12094, 'Carping', 'a.', 'Fault-finding; censorious caviling. See Captious.'),
(12095, 'Carpi', 'pl. ', 'of Carpus'),
(12096, 'Carpus', 'n.', 'The wrist; the bones or cartilages between the forearm, or\n   antibrachium, and the hand or forefoot; in man, consisting of eight\n   short bones disposed in two rows.'),
(12097, 'Carrack', 'n.', 'See Carack.'),
(12098, 'Carraway', 'n.', 'See Caraway.'),
(12099, 'Carrel', 'n.', 'See Quarrel, an arrow.'),
(12100, 'Carrel', 'n.', 'Same as 4th Carol.'),
(12101, 'Carriage', 'n.', 'That which is carried; burden; baggage.'),
(12102, 'Carriage', 'n.', 'The act of carrying, transporting, or conveying.'),
(12103, 'Carriage', 'n.', 'The price or expense of carrying.'),
(12104, 'Carriage', 'n.', 'That which carries of conveys,'),
(12105, 'Carriage', 'n.', 'A wheeled vehicle for persons, esp. one designed for\n   elegance and comfort.'),
(12106, 'Carriage', 'n.', 'A wheeled vehicle carrying a fixed burden, as a gun\n   carriage.'),
(12107, 'Carriage', 'n.', 'A part of a machine which moves and carries of supports\n   some other moving object or part.'),
(12108, 'Carriage', 'n.', 'A frame or cage in which something is carried or\n   supported; as, a bell carriage.'),
(12109, 'Carriage', 'n.', 'The manner of carrying one\'s self; behavior; bearing;\n   deportment; personal manners.'),
(12110, 'Carriage', 'n.', 'The act or manner of conducting measures or projects;\n   management.'),
(12111, 'Carriboo', 'n.', 'See Caribou.'),
(12112, 'Carrick', 'n.', 'A carack. See Carack.'),
(12113, 'Carrier', 'n.', 'One who, or that which, carries or conveys; a messenger.'),
(12114, 'Carrier', 'n.', 'One who is employed, or makes it his business, to carry\n   goods for others for hire; a porter; a teamster.'),
(12115, 'Carrier', 'n.', 'That which drives or carries; as: (a) A piece which\n   communicates to an object in a lathe the motion of the face plate; a\n   lathe dog. (b) A spool holder or bobbin holder in a braiding machine.\n   (c) A movable piece in magazine guns which transfers the cartridge to a\n   position from which it can be thrust into the barrel.'),
(12116, 'Carrion', 'n.', 'The dead and putrefying body or flesh of an animal; flesh\n   so corrupted as to be unfit for food.'),
(12117, 'Carrion', 'n.', 'A contemptible or worthless person; -- a term of reproach.'),
(12118, 'Carrion', 'a.', 'Of or pertaining to dead and putrefying carcasses; feeding\n   on carrion.'),
(12119, 'Carrol', 'n.', 'See 4th Carol.'),
(12120, 'Carrom', 'n.', 'See Carom.'),
(12121, 'Carrot', 'n.', 'An umbelliferous biennial plant (Daucus Carota), of many\n   varieties.'),
(12122, 'Carrot', 'n.', 'The esculent root of cultivated varieties of the plant,\n   usually spindle-shaped, and of a reddish yellow color.'),
(12123, 'Carroty', 'a.', 'Like a carrot in color or in taste; -- an epithet given to\n   reddish yellow hair, etc.'),
(12124, 'Carrow', 'n.', 'A strolling gamester.'),
(12125, 'Carried', 'imp. & p. p.', 'of Carry'),
(12126, 'Carrying', 'p. pr. & vb. n.', 'of Carry'),
(12127, 'Carry', 'v. t.', 'To convey or transport in any manner from one place to\n   another; to bear; -- often with away or off.'),
(12128, 'Carry', 'v. t.', 'To have or hold as a burden, while moving from place to\n   place; to have upon or about one\'s person; to bear; as, to carry a\n   wound; to carry an unborn child.'),
(12129, 'Carry', 'v. t.', 'To move; to convey by force; to impel; to conduct; to\n   lead or guide.'),
(12130, 'Carry', 'v. t.', 'To transfer from one place (as a country, book, or\n   column) to another; as, to carry the war from Greece into Asia; to\n   carry an account to the ledger; to carry a number in adding figures.'),
(12131, 'Carry', 'v. t.', 'To convey by extension or continuance; to extend; as, to\n   carry the chimney through the roof; to carry a road ten miles farther.'),
(12132, 'Carry', 'v. t.', 'To bear or uphold successfully through conflict, as a\n   leader or principle; hence, to succeed in, as in a contest; to bring to\n   a successful issue; to win; as, to carry an election.'),
(12133, 'Carry', 'v. t.', 'To get possession of by force; to capture.'),
(12134, 'Carry', 'v. t.', 'To contain; to comprise; to bear the aspect of ; to show\n   or exhibit; to imply.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(12135, 'Carry', 'v. t.', 'To bear (one\'s self); to behave, to conduct or demean; --\n   with the reflexive pronouns.'),
(12136, 'Carry', 'v. t.', 'To bear the charges or burden of holding or having, as\n   stocks, merchandise, etc., from one time to another; as, a merchant is\n   carrying a large stock; a farm carries a mortgage; a broker carries\n   stock for a customer; to carry a life insurance.'),
(12137, 'Carry', 'v. i.', 'To act as a bearer; to convey anything; as, to fetch and\n   carry.'),
(12138, 'Carry', 'v. i.', 'To have propulsive power; to propel; as, a gun or mortar\n   carries well.'),
(12139, 'Carry', 'v. i.', 'To hold the head; -- said of a horse; as, to carry well\n   i. e., to hold the head high, with arching neck.'),
(12140, 'Carry', 'v. i.', 'To have earth or frost stick to the feet when running, as\n   a hare.'),
(12141, 'Carries', 'pl. ', 'of Carry'),
(12142, 'Carry', 'n.', 'A tract of land, over which boats or goods are carried\n   between two bodies of navigable water; a carrying place; a portage.'),
(12143, 'Carryall', 'n.', 'A light covered carriage, having four wheels and seats\n   for four or more persons, usually drawn by one horse.'),
(12144, 'Carrying', 'n.', 'The act or business of transporting from one place to\n   another.'),
(12145, 'Carryk', 'n.', 'A carack.'),
(12146, 'Carse', 'n.', 'Low, fertile land; a river valley.'),
(12147, 'Carted', 'imp. & p. p.', 'of Cart'),
(12148, 'Carting', 'p. pr. & vb. n.', 'of Cart'),
(12149, 'Cartage', 'n.', 'The act of carrying in a cart.'),
(12150, 'Cartage', 'n.', 'The price paid for carting.'),
(12151, 'Cartbote', 'n.', 'Wood to which a tenant is entitled for making and\n   repairing carts and other instruments of husbandry.'),
(12152, 'Carte', 'n.', 'Bill of fare.'),
(12153, 'Carte', 'n.', 'Short for Carte de visite.'),
(12154, 'Carte', 'n.', 'Alt. of Quarte'),
(12155, 'Quarte', 'n.', 'A position in thrusting or parrying, with the inside of the\n   hand turned upward and the point of the weapon toward the adversary\'s\n   right breast.'),
(12156, 'Cartel', 'n.', 'An agreement between belligerents for the exchange of\n   prisoners.'),
(12157, 'Cartel', 'n.', 'A letter of defiance or challenge; a challenge to single\n   combat.'),
(12158, 'Cartel', 'v. t.', 'To defy or challenge.'),
(12159, 'Carter', 'n.', 'A charioteer.'),
(12160, 'Carter', 'n.', 'A man who drives a cart; a teamster.'),
(12161, 'Carter', 'n.', 'Any species of Phalangium; -- also called harvestman'),
(12162, 'Carter', 'n.', 'A British fish; the whiff.'),
(12163, 'Cartman', 'n.', 'One who drives or uses a cart; a teamster; a carter.'),
(12164, 'Carton', 'n.', 'Pasteboard for paper boxes; also, a pasteboard box.'),
(12165, 'Cartoon', 'n.', 'A design or study drawn of the full size, to serve as a\n   model for transferring or copying; -- used in the making of mosaics,\n   tapestries, fresco pantings and the like; as, the cartoons of Raphael.'),
(12166, 'Cartoon', 'n.', 'A large pictorial sketch, as in a journal or magazine;\n   esp. a pictorial caricature; as, the cartoons of \"Puck.\"'),
(12167, 'Cartouch', 'n.', 'A roll or case of paper, etc., holding a charge for a\n   firearm; a cartridge'),
(12168, 'Cartouch', 'n.', 'A cartridge box.'),
(12169, 'Cartouch', 'n.', 'A wooden case filled with balls, to be shot from a\n   cannon.'),
(12170, 'Cartouch', 'n.', 'A gunner\'s bag for ammunition'),
(12171, 'Cartouch', 'n.', 'A military pass for a soldier on furlough.'),
(12172, 'Cartouch', 'n.', 'A cantalever, console, corbel, or modillion, which has\n   the form of a scroll of paper'),
(12173, 'Cartouch', 'n.', 'A tablet for ornament, or for receiving an inscription,\n   formed like a sheet of paper with the edges rolled up; hence, any\n   tablet of ornamental form.'),
(12174, 'Cartouch', 'n.', 'An oval figure on monuments, and in papyri, containing\n   the name of a sovereign.'),
(12175, 'Cartway', 'n.', 'A way or road for carts.'),
(12176, 'Carucage', 'n.', 'A tax on every plow or plowland.'),
(12177, 'Carucage', 'n.', 'The act of plowing.'),
(12178, 'Carucate', 'n.', 'A plowland; as much land as one team can plow in a year\n   and a day; -- by some said to be about 100 acres.'),
(12179, 'Caruncle', 'n.', 'Alt. of Caruncula'),
(12180, 'Carus', 'n.', 'Coma with complete insensibility; deep lethargy.'),
(12181, 'Carved', 'imp. & p. p.', 'of Carve'),
(12182, 'Carving', 'p. pr. & vb. n.', 'of Carve'),
(12183, 'Carve', 'v. t.', 'To cut.'),
(12184, 'Carve', 'v. t.', 'To cut, as wood, stone, or other material, in an artistic\n   or decorative manner; to sculpture; to engrave.'),
(12185, 'Carve', 'v. t.', 'To make or shape by cutting, sculpturing, or engraving;\n   to form; as, to carve a name on a tree.'),
(12186, 'Carve', 'v. t.', 'To cut into small pieces or slices, as meat at table; to\n   divide for distribution or apportionment; to apportion.'),
(12187, 'Carve', 'v. t.', 'To cut: to hew; to mark as if by cutting.'),
(12188, 'Carve', 'v. t.', 'To take or make, as by cutting; to provide.'),
(12189, 'Carve', 'v. t.', 'To lay out; to contrive; to design; to plan.'),
(12190, 'Carve', 'v. i.', 'To exercise the trade of a sculptor or carver; to engrave\n   or cut figures.'),
(12191, 'Carve', 'v. i.', 'To cut up meat; as, to carve for all the guests.'),
(12192, 'Carve', 'n.', 'A carucate.'),
(12193, 'Carvel', 'n.', 'Same as Caravel.'),
(12194, 'Carvel', 'n.', 'A species of jellyfish; sea blubber.'),
(12195, 'Carven', 'a.', 'Wrought by carving; ornamented by carvings; carved.'),
(12196, 'Carvene', 'n.', 'An oily substance, C10H16, extracted from oil caraway.'),
(12197, 'Carver', 'n.', 'One who carves; one who shapes or fashions by carving, or\n   as by carving; esp. one who carves decorative forms, architectural\n   adornments, etc.'),
(12198, 'Carver', 'n.', 'One who carves or divides meat at table.'),
(12199, 'Carver', 'n.', 'A large knife for carving.'),
(12200, 'Carving', 'n.', 'The act or art of one who carves.'),
(12201, 'Carving', 'n.', 'A piece of decorative work cut in stone, wood, or other\n   material.'),
(12202, 'Carving', 'n.', 'The whole body of decorative sculpture of any kind or\n   epoch, or in any material; as, the Italian carving of the 15th century.'),
(12203, 'Carvist', 'n.', 'A hawk which is of proper age and training to be carried\n   on the hand; a hawk in its first year.'),
(12204, 'Carvol', 'n.', 'One of a species of aromatic oils, resembling carvacrol.'),
(12205, 'Caryatic', 'a.', 'Alt. of Caryatid'),
(12206, 'Caryatid', 'a.', 'Of or pertaining to a caryatid.'),
(12207, 'Caryatid', 'n.', 'A draped female figure supporting an entablature, in the\n   place of a column or pilaster.'),
(12208, 'Casal', 'a.', 'Of or pertaining to case; as, a casal ending.'),
(12209, 'Cascabel', 'n.', 'The projection in rear of the breech of a cannon, usually\n   a knob or breeching loop connected with the gun by a neck. In old\n   writers it included all in rear of the base ring. [See Illust. of\n   Cannon.]'),
(12210, 'Cascade', 'n.', 'A fall of water over a precipice, as in a river or brook;\n   a waterfall less than a cataract.'),
(12211, 'Cascade', 'v. i.', 'To fall in a cascade.'),
(12212, 'Cascade', 'v. i.', 'To vomit.'),
(12213, 'Cascalho', 'n.', 'A deposit of pebbles, gravel, and ferruginous sand, in\n   which the Brazilian diamond is usually found.'),
(12214, 'Cased', 'imp. & p. p.', 'of Case'),
(12215, 'Casing', 'p. pr. & vb. n.', 'of Case'),
(12216, 'Case-bay', 'n.', 'The space between two principals or girders'),
(12217, 'Case-bay', 'n.', 'One of the joists framed between a pair of girders in\n   naked flooring.'),
(12218, 'Caseic', 'a.', 'Of or pertaining to cheese; as, caseic acid.'),
(12219, 'Casein', 'n.', 'A proteid substance present in both the animal and the\n   vegetable kingdom. In the animal kingdom it is chiefly found in milk,\n   and constitutes the main part of the curd separated by rennet; in the\n   vegetable kingdom it is found more or less abundantly in the seeds of\n   leguminous plants. Its reactions resemble those of alkali albumin.'),
(12220, 'Casemate', 'n.', 'A bombproof chamber, usually of masonry, in which cannon\n   may be placed, to be fired through embrasures; or one capable of being\n   used as a magazine, or for quartering troops.'),
(12221, 'Casemate', 'n.', 'A hollow molding, chiefly in cornices.'),
(12222, 'Casement', 'n.', 'A window sash opening on hinges affixed to the upright\n   side of the frame into which it is fitted. (Poetically) A window.'),
(12223, 'Caseous', 'a.', 'Of, pertaining to, or resembling, cheese; having the\n   qualities of cheese; cheesy.'),
(12224, 'Casern', 'n.', 'A lodging for soldiers in garrison towns, usually near the\n   rampart; barracks.'),
(12225, 'Caseum', 'n.', 'Same as Casein.'),
(12226, 'Caseworm', 'n.', 'A worm or grub that makes for itself a case. See Caddice.'),
(12227, 'Cashed', 'imp. & p. p.', 'of Cash'),
(12228, 'Casing', 'p. pr. & vb. n.', 'of Cash'),
(12229, 'Cashbook', 'n.', 'A book in which is kept a register of money received or\n   paid out.'),
(12230, 'Cashew', 'n.', 'A tree (Anacardium occidentale) of the same family which\n   the sumac. It is native in tropical America, but is now naturalized in\n   all tropical countries. Its fruit, a kidney-shaped nut, grows at the\n   extremity of an edible, pear-shaped hypocarp, about three inches long.'),
(12231, 'Cashier', 'n.', 'One who has charge of money; a cash keeper; the officer\n   who has charge of the payments and receipts (moneys, checks, notes), of\n   a bank or a mercantile company.'),
(12232, 'Cahiered', 'imp. & p. p.', 'of Cashier'),
(12233, 'Cashier', 'v. t.', 'To dismiss or discard; to discharge; to dismiss with\n   ignominy from military service or from an office or place of trust.'),
(12234, 'Cashier', 'v. t.', 'To put away or reject; to disregard.'),
(12235, 'Cashmere', 'n.', 'A rich stuff for shawls, scarfs, etc., originally made in\n   Cashmere from the soft wool found beneath the hair of the goats of\n   Cashmere, Thibet, and the Himalayas. Some cashmere, of fine quality, is\n   richly embroidered for sale to Europeans.'),
(12236, 'Cashmere', 'n.', 'A dress fabric made of fine wool, or of fine wool and\n   cotton, in imitation of the original cashmere.'),
(12237, 'Cashoo', 'n.', 'See Catechu.'),
(12238, 'Casing', 'n.', 'The act or process of inclosing in, or covering with, a\n   case or thin substance, as plaster, boards, etc.'),
(12239, 'Casing', 'n.', 'An outside covering, for protection or ornament, or to\n   precent the radiation of heat.'),
(12240, 'Casing', 'n.', 'An inclosing frame; esp. the framework around a door or a\n   window. See Case, n., 4.'),
(12241, 'Casings', 'n. pl.', 'Dried dung of cattle used as fuel.'),
(12242, 'Casinos', 'pl. ', 'of Casino'),
(12243, 'Casini', 'pl. ', 'of Casino'),
(12244, 'Casino', 'n.', 'A small country house.'),
(12245, 'Casino', 'n.', 'A building or room used for meetings, or public amusements,\n   for dancing, gaming, etc.'),
(12246, 'Casino', 'n.', 'A game at cards. See Cassino.'),
(12247, 'Casket', 'n.', 'A small chest or box, esp. of rich material or ornamental\n   character, as for jewels, etc.'),
(12248, 'Casket', 'n.', 'A kind of burial case.'),
(12249, 'Casket', 'n.', 'Anything containing or intended to contain something highly\n   esteemed'),
(12250, 'Casket', 'n.', 'The body.'),
(12251, 'Casket', 'n.', 'The tomb.'),
(12252, 'Casket', 'n.', 'A book of selections.'),
(12253, 'Casket', 'n.', 'A gasket. See Gasket.'),
(12254, 'Casket', 'v. t.', 'To put into, or preserve in, a casket.'),
(12255, 'Casque', 'n.', 'A piece of defensive or ornamental armor (with or without a\n   vizor) for the head and neck; a helmet.'),
(12256, 'Cassada', 'n.', 'See Cassava.'),
(12257, 'Cassate', 'v. t.', 'To render void or useless; to vacate or annul.'),
(12258, 'Cassava', 'n.', 'A shrubby euphorbiaceous plant of the genus Manihot, with\n   fleshy rootstocks yielding an edible starch; -- called also manioc.'),
(12259, 'Cassava', 'n.', 'A nutritious starch obtained from the rootstocks of the\n   cassava plant, used as food and in making tapioca.'),
(12260, 'Cassia', 'n.', 'A genus of leguminous plants (herbs, shrubs, or trees) of\n   many species, most of which have purgative qualities. The leaves of\n   several species furnish the senna used in medicine.'),
(12261, 'Cassia', 'n.', 'The bark of several species of Cinnamomum grown in China,\n   etc.; Chinese cinnamon. It is imported as cassia, but commonly sold as\n   cinnamon, from which it differs more or less in strength and flavor,\n   and the amount of outer bark attached.'),
(12262, 'Cassican', 'n.', 'An American bird of the genus Cassicus, allied to the\n   starlings and orioles, remarkable for its skillfully constructed and\n   suspended nest; the crested oriole. The name is also sometimes given to\n   the piping crow, an Australian bird.'),
(12263, 'Cassino', 'n.', 'A game at cards, played by two or more persons, usually\n   for twenty-one points.'),
(12264, 'Cassius', 'n.', 'A brownish purple pigment, obtained by the action of some\n   compounds of tin upon certain salts of gold. It is used in painting and\n   staining porcelain and glass to give a beautiful purple color. Commonly\n   called Purple of Cassius.'),
(12265, 'Cassock', 'n.', 'A long outer garment formerly worn by men and women, as\n   well as by soldiers as part of their uniform.'),
(12266, 'Cassock', 'n.', 'A garment resembling a long frock coat worn by the clergy\n   of certain churches when officiating, and by others as the usually\n   outer garment.'),
(12267, 'Casting', 'p. pr. & vb. n.', 'of Cast'),
(12268, 'Castanea', 'n.', 'A genus of nut-bearing trees or shrubs including the\n   chestnut and chinquapin.'),
(12269, 'Castanet', 'n.', 'See Castanets.'),
(12270, 'Castaway', 'n.', 'One who, or that which, is cast away or shipwrecked.'),
(12271, 'Castaway', 'n.', 'One who is ruined; one who has made moral shipwreck; a\n   reprobate.'),
(12272, 'Castaway', 'a.', 'Of no value; rejected; useless.'),
(12273, 'Caste', 'n.', 'One of the hereditary classes into which the Hindoos are\n   divided according to the laws of Brahmanism.'),
(12274, 'Caste', 'n.', 'A separate and fixed order or class of persons in society\n   who chiefly hold intercourse among themselves.'),
(12275, 'Caster', 'n.', 'One who casts; as, caster of stones, etc. ; a caster of\n   cannon; a caster of accounts.'),
(12276, 'Caster', 'n.', 'A vial, cruet, or other small vessel, used to contain\n   condiments at the table; as, a set of casters.'),
(12277, 'Caster', 'n.', 'A stand to hold a set of cruets.'),
(12278, 'Caster', 'n.', 'A small wheel on a swivel, on which furniture is supported\n   and moved.'),
(12279, 'Casting', 'n.', 'The act of one who casts or throws, as in fishing.'),
(12280, 'Casting', 'n.', 'The act or process of making casts or impressions, or of\n   shaping metal or plaster in a mold; the act or the process of pouring\n   molten metal into a mold.'),
(12281, 'Casting', 'n.', 'That which is cast in a mold; esp. the mass of metal so\n   cast; as, a casting in iron; bronze casting.'),
(12282, 'Casting', 'n.', 'The warping of a board.'),
(12283, 'Casting', 'n.', 'The act of casting off, or that which is cast off, as\n   skin, feathers, excrement, etc.'),
(12284, 'Castle', 'n.', 'A fortified residence, especially that of a prince or\n   nobleman; a fortress.'),
(12285, 'Castle', 'n.', 'Any strong, imposing, and stately mansion.'),
(12286, 'Castle', 'n.', 'A small tower, as on a ship, or an elephant\'s back.'),
(12287, 'Castle', 'n.', 'A piece, made to represent a castle, used in the game of\n   chess; a rook.'),
(12288, 'Castled', 'imp. & p. p.', 'of Castle'),
(12289, 'Castling', 'p. pr. & vb. n.', 'of Castle'),
(12290, 'Castle', 'v. i.', 'To move the castle to the square next to king, and then\n   the king around the castle to the square next beyond it, for the\n   purpose of covering the king.'),
(12291, 'Castled', 'a.', 'Having a castle or castles; supporting a castle; as, a\n   castled height or crag.'),
(12292, 'Castled', 'a.', 'Fortified; turreted; as, castled walls.'),
(12293, 'Castlery', 'n.', 'The government of a castle.'),
(12294, 'Castlet', 'n.', 'A small castle.'),
(12295, 'Castling', 'n.', 'That which is cast or brought forth prematurely; an\n   abortion.'),
(12296, 'Castling', 'n.', 'A compound move of the king and castle. See Castle, v. i.'),
(12297, 'Cast-off', 'a.', 'Cast or laid aside; as, cast-off clothes.'),
(12298, 'Castor', 'n.', 'A genus of rodents, including the beaver. See Beaver.'),
(12299, 'Castor', 'n.', 'Castoreum. See Castoreum.'),
(12300, 'Castor', 'n.', 'A hat, esp. one made of beaver fur; a beaver.'),
(12301, 'Castor', 'n.', 'A heavy quality of broadcloth for overcoats.'),
(12302, 'Castor', 'n.', 'See Caster, a small wheel.'),
(12303, 'Castor', 'n.', 'the northernmost of the two bright stars in the\n   constellation Gemini, the other being Pollux.'),
(12304, 'Castor', 'n.', 'Alt. of Castorite'),
(12305, 'Castorin', 'n.', 'A white crystalline substance obtained from castoreum.'),
(12306, 'Castrate', 'v. t.', 'To deprive of the testicles; to emasculate; to geld;\n   to alter.'),
(12307, 'Castrate', 'v. t.', 'To cut or take out; esp. to remove anything erroneous,\n   or objectionable from, as the obscene parts of a writing; to expurgate.'),
(12308, 'Castrato', 'n.', 'A male person castrated for the purpose of improving his\n   voice for singing; an artificial, or male, soprano.'),
(12309, 'Castrel', 'n.', 'See Kestrel.'),
(12310, 'Casual', 'a.', 'Happening or coming to pass without design, and without\n   being foreseen or expected; accidental; fortuitous; coming by chance.'),
(12311, 'Casual', 'a.', 'Coming without regularity; occasional; incidental; as,\n   casual expenses.'),
(12312, 'Casual', 'n.', 'One who receives relief for a night in a parish to which he\n   does not belong; a vagrant.'),
(12313, 'Casually', 'adv.', 'Without design; accidentally; fortuitously; by chance;\n   occasionally.'),
(12314, 'Casualty', 'n.', 'That which comes without design or without being\n   foreseen; contingency.'),
(12315, 'Casualty', 'n.', 'Any injury of the body from accident; hence, death, or\n   other misfortune, occasioned by an accident; as, an unhappy casualty.'),
(12316, 'Casualty', 'n.', 'Numerical loss caused by death, wounds, discharge, or\n   desertion.'),
(12317, 'Casuist', 'n.', 'One who is skilled in, or given to, casuistry.'),
(12318, 'Casuist', 'v. i.', 'To play the casuist.'),
(12319, 'Casus', 'n.', 'An event; an occurrence; an occasion; a combination of\n   circumstances; a case; an act of God. See the Note under Accident.'),
(12320, 'Catting', 'p. pr. & vb. n.', 'of Cat'),
(12321, 'Catacomb', 'n.', 'A cave, grotto, or subterraneous place of large extent\n   used for the burial of the dead; -- commonly in the plural.'),
(12322, 'Cataian', 'n.', 'A native of Cathay or China; a foreigner; -- formerly a\n   term of reproach.'),
(12323, 'Catalan', 'a.', 'Of or pertaining to Catalonia.'),
(12324, 'Catalan', 'n.', 'A native or inhabitant of Catalonia; also, the language of\n   Catalonia.'),
(12325, 'Catalog', 'n. & v.', 'Catalogue.'),
(12326, 'Catalpa', 'n.', 'A genus of American and East Indian trees, of which the\n   best know species are the Catalpa bignonioides, a large, ornamental\n   North American tree, with spotted white flowers and long cylindrical\n   pods, and the C. speciosa, of the Mississipi valley; -- called also\n   Indian bean.'),
(12327, 'Catalyse', 'pl. ', 'of Catalysis'),
(12328, 'Catamite', 'n.', 'A boy kept for unnatural purposes.'),
(12329, 'Catapasm', 'n.', 'A compound medicinal powder, used by the ancients to\n   sprinkle on ulcers, to absorb perspiration, etc.'),
(12330, 'Catapuce', 'n.', 'Spurge.'),
(12331, 'Catapult', 'n.', 'An engine somewhat resembling a massive crossbow, used by\n   the ancient Greeks and Romans for throwing stones, arrows, spears, etc.'),
(12332, 'Catapult', 'n.', 'A forked stick with elastic band for throwing small\n   stones, etc.'),
(12333, 'Cataract', 'n.', 'A great fall of water over a precipice; a large\n   waterfall.'),
(12334, 'Cataract', 'n.', 'An opacity of the crystalline lens, or of its capsule,\n   which prevents the passage of the rays of light and impairs or destroys\n   the sight.'),
(12335, 'Cataract', 'n.', 'A kind of hydraulic brake for regulating the action of\n   pumping engines and other machines; -- sometimes called dashpot.'),
(12336, 'Catarrh', 'n.', 'An inflammatory affection of any mucous membrane, in which\n   there are congestion, swelling, and an altertion in the quantity and\n   quality of mucus secreted; as, catarrh of the stomach; catarrh of the\n   bladder.'),
(12337, 'Catawba', 'n.', 'A well known light red variety of American grape.'),
(12338, 'Catawba', 'n.', 'A light-colored, sprightly American wine from the Catawba\n   grape.'),
(12339, 'Catawbas', 'n. pl.', 'An Appalachian tribe of Indians which originally\n   inhabited the regions near the Catawba river and the head waters of the\n   Santee.'),
(12340, 'Catbird', 'n.', 'An American bird (Galeoscoptes Carolinensis), allied to\n   the mocking bird, and like it capable of imitating the notes of other\n   birds, but less perfectly. Its note resembles at times the mewing of a\n   cat.'),
(12341, 'Catboat', 'n.', 'A small sailboat, with a single mast placed as far forward\n   as possible, carring a sail extended by a gaff and long boom. See\n   Illustration in Appendix.'),
(12342, 'Catcall', 'n.', 'A sound like the cry of a cat, such as is made in\n   playhouses to express dissatisfaction with a play; also, a small shrill\n   instrument for making such a noise.'),
(12343, 'Caught', 'imp. & p. p.', 'of Catch'),
(12344, 'Catched', '', 'of Catch'),
(12345, 'Catching', 'p. pr. & vb. n.', 'of Catch'),
(12346, 'Catch', 'v. t.', 'To lay hold on; to seize, especially with the hand; to\n   grasp (anything) in motion, with the effect of holding; as, to catch a\n   ball.'),
(12347, 'Catch', 'v. t.', 'To seize after pursuing; to arrest; as, to catch a thief.'),
(12348, 'Catch', 'v. t.', 'To take captive, as in a snare or net, or on a hook; as,\n   to catch a bird or fish.'),
(12349, 'Catch', 'v. t.', 'Hence: To insnare; to entangle.'),
(12350, 'Catch', 'v. t.', 'To seize with the senses or the mind; to apprehend; as,\n   to catch a melody.'),
(12351, 'Catch', 'v. t.', 'To communicate to; to fasten upon; as, the fire caught\n   the adjoining building.'),
(12352, 'Catch', 'v. t.', 'To engage and attach; to please; to charm.'),
(12353, 'Catch', 'v. t.', 'To get possession of; to attain.'),
(12354, 'Catch', 'v. t.', 'To take or receive; esp. to take by sympathy, contagion,\n   infection, or exposure; as, to catch the spirit of an occasion; to\n   catch the measles or smallpox; to catch cold; the house caught fire.'),
(12355, 'Catch', 'v. t.', 'To come upon unexpectedly or by surprise; to find; as, to\n   catch one in the act of stealing.'),
(12356, 'Catch', 'v. t.', 'To reach in time; to come up with; as, to catch a train.'),
(12357, 'Catch', 'v. i.', 'To attain possession.'),
(12358, 'Catch', 'v. i.', 'To be held or impeded by entanglement or a light\n   obstruction; as, a kite catches in a tree; a door catches so as not to\n   open.'),
(12359, 'Catch', 'v. i.', 'To take hold; as, the bolt does not catch.'),
(12360, 'Catch', 'v. i.', 'To spread by, or as by, infecting; to communicate.'),
(12361, 'Catch', 'n.', 'Act of seizing; a grasp.'),
(12362, 'Catch', 'n.', 'That by which anything is caught or temporarily fastened;\n   as, the catch of a gate.'),
(12363, 'Catch', 'n.', 'The posture of seizing; a state of preparation to lay hold\n   of, or of watching he opportunity to seize; as, to lie on the catch.'),
(12364, 'Catch', 'n.', 'That which is caught or taken; profit; gain; especially, the\n   whole quantity caught or taken at one time; as, a good catch of fish.'),
(12365, 'Catch', 'n.', 'Something desirable to be caught, esp. a husband or wife in\n   matrimony.'),
(12366, 'Catch', 'n.', 'Passing opportunities seized; snatches.'),
(12367, 'Catch', 'n.', 'A slight remembrance; a trace.'),
(12368, 'Catch', 'n.', 'A humorous canon or round, so contrived that the singers\n   catch up each other\'s words.'),
(12369, 'Catcher', 'n.', 'One who, or that which, catches.'),
(12370, 'Catcher', 'n.', 'The player who stands behind the batsman to catch the\n   ball.'),
(12371, 'Catchfly', 'n.', 'A plant with the joints of the stem, and sometimes other\n   parts, covered with a viscid secretion to which small insects adhere.\n   The species of Silene are examples of the catchfly.'),
(12372, 'Catching', 'a.', 'Infectious; contagious.'),
(12373, 'Catching', 'a.', 'Captivating; alluring.'),
(12374, 'Catching', 'n.', 'The act of seizing or taking hold of.'),
(12375, 'Catchup', 'n.', 'Alt. of Catsup'),
(12376, 'Catsup', 'n.', 'A table sauce made from mushrooms, tomatoes, walnuts, etc.'),
(12377, 'Catechin', 'n.', 'One of the tannic acids, extracted from catechu as a\n   white, crystalline substance; -- called also catechuic acid, and\n   catechuin.'),
(12378, 'Catechu', 'n.', 'A dry, brown, astringent extract, obtained by decoction\n   and evaporation from the Acacia catechu, and several other plants\n   growing in India. It contains a large portion of tannin or tannic acid,\n   and is used in medicine and in the arts. It is also known by the names\n   terra japonica, cutch, gambier, etc.'),
(12379, 'Category', 'n.', 'One of the highest classes to which the objects of\n   knowledge or thought can be reduced, and by which they can be arranged\n   in a system; an ultimate or undecomposable conception; a predicament.'),
(12380, 'Category', 'n.', 'Class; also, state, condition, or predicament; as, we are\n   both in the same category.'),
(12381, 'Catel', 'n.', 'Property; -- often used by Chaucer in contrast with rent, or\n   income.'),
(12382, 'Catene', 'pl. ', 'of Catena'),
(12383, 'Catena', 'n.', 'A chain or series of things connected with each other.'),
(12384, 'Catenary', 'a.', 'Alt. of Catenarian'),
(12385, 'Catenary', 'n.', 'The curve formed by a rope or chain of uniform density\n   and perfect flexibility, hanging freely between two points of\n   suspension, not in the same vertical line.'),
(12386, 'Catenate', 'v. t.', 'To connect, in a series of links or ties; to chain.'),
(12387, 'Cater', 'n.', 'A provider; a purveyor; a caterer.'),
(12388, 'Catered', 'imp. & p. p.', 'of Cater'),
(12389, 'Catering', 'p. pr. & vb. n.', 'of Cater'),
(12390, 'Cater', 'n.', 'To provide food; to buy, procure, or prepare provisions.'),
(12391, 'Cater', 'n.', 'By extension: To supply what is needed or desired, at\n   theatrical or musical entertainments; -- followed by for or to.'),
(12392, 'Cater', 'n.', 'The four of cards or dice.'),
(12393, 'Cater', 'v. t.', 'To cut diagonally.'),
(12394, 'Cateran', 'n.', 'A Highland robber: a kind of irregular soldier.'),
(12395, 'Caterer', 'n.', 'One who caters.'),
(12396, 'Cateress', 'n.', 'A woman who caters.'),
(12397, 'Catery', 'n.', 'The place where provisions are deposited.'),
(12398, 'Cates', 'n.', 'Provisions; food; viands; especially, luxurious food;\n   delicacies; dainties.'),
(12399, 'Cat-eyed', 'a.', 'Having eyes like a cat; hence, able to see in the dark.'),
(12400, 'Catfall', 'n.', 'A rope used in hoisting the anchor to the cathead.'),
(12401, 'Catfish', 'n.', 'A name given in the United States to various species of\n   siluroid fishes; as, the yellow cat (Amiurus natalis); the bind cat\n   (Gronias nigrilabrus); the mud cat (Pilodictic oilwaris), the stone cat\n   (Noturus flavus); the sea cat (Arius felis), etc. This name is also\n   sometimes applied to the wolf fish. See Bullhrad.'),
(12402, 'Catgut', 'n.', 'A cord of great toughness made from the intestines of\n   animals, esp. of sheep, used for strings of musical instruments, etc.'),
(12403, 'Catgut', 'n.', 'A sort of linen or canvas, with wide interstices.'),
(12404, 'Cathay', 'n.', 'China; -- an old name for the Celestial Empire, said have\n   been introduced by Marco Polo and to be a corruption of the Tartar name\n   for North China (Khitai, the country of the Khitans.)'),
(12405, 'Cathead', 'n.', 'A projecting piece of timber or iron near the bow of\n   vessel, to which the anchor is hoisted and secured.'),
(12406, 'Cathedra', 'n.', 'The official chair or throne of a bishop, or of any\n   person in high authority.'),
(12407, 'Catheter', 'n.', 'The name of various instruments for passing along mucous\n   canals, esp. applied to a tubular instrument to be introduced into the\n   bladder through the urethra to draw off the urine.'),
(12408, 'Catheti', 'pl. ', 'of Cathetus'),
(12409, 'Cathetus', 'n.', 'One line or radius falling perpendicularly on another;\n   as, the catheti of a right-angled triangle, that is, the two sides that\n   include the right angle.'),
(12410, 'Cathode', 'n.', 'The part of a voltaic battery by which the electric\n   current leaves substances through which it passes, or the surface at\n   which the electric current passes out of the electrolyte; the negative\n   pole; -- opposed to anode.'),
(12411, 'Cathodic', 'a.', 'A term applied to the centrifugal, or efferent, course of\n   the nervous influence.'),
(12412, 'Cat-hole', 'n.', 'One of two small holes astern, above the gunroom ports,\n   through which hawsers may be passed.'),
(12413, 'Catholic', 'a.', 'Universal or general; as, the catholic faith.'),
(12414, 'Catholic', 'a.', 'Not narrow-minded, partial, or bigoted; liberal; as,\n   catholic tastes.'),
(12415, 'Catholic', 'a.', 'Of or pertaining to, or affecting the Roman Catholics;\n   as, the Catholic emancipation act.'),
(12416, 'Catholic', 'n.', 'A person who accepts the creeds which are received in\n   common by all parts of the orthodox Christian church.'),
(12417, 'Catholic', 'n.', 'An adherent of the Roman Catholic church; a Roman\n   Catholic.'),
(12418, 'Cation', 'n.', 'An electro-positive substance, which in\n   electro-decomposition is evolved at the cathode; -- opposed to anion.'),
(12419, 'Catkin', 'n.', 'An ament; a species of inflorescence, consisting of a\n   slender axis with many unisexual apetalous flowers along its sides, as\n   in the willow and poplar, and (as to the staminate flowers) in the\n   chestnut, oak, hickory, etc. -- so called from its resemblance to a\n   cat\'s tail. See Illust. of Ament.'),
(12420, 'Catlike', 'a.', 'Like a cat; stealthily; noiselessly.'),
(12421, 'Catling', 'n.', 'A little cat; a kitten.'),
(12422, 'Catling', 'n.', 'Catgut; a catgut string.'),
(12423, 'Catling', 'n.', 'A double-edged, sharp-pointed dismembering knife.'),
(12424, 'Catnip', 'n.', 'Alt. of Catmint'),
(12425, 'Catmint', 'n.', 'A well-know plant of the genus Nepeta (N. Cataria),\n   somewhat like mint, having a string scent, and sometimes used in\n   medicine. It is so called because cats have a peculiar fondness for it.'),
(12426, 'Catonian', 'a.', 'Of, pertaining to, or resembling, the stern old Roman,\n   Cato the Censor; severe; inflexible.'),
(12427, 'Catopter', 'n.', 'Alt. of Catoptron'),
(12428, 'Catopron', 'n.', 'See Catopter.'),
(12429, 'Catpipe', 'n.', 'See Catcall.'),
(12430, 'Cat-salt', 'n.', 'A sort of salt, finely granulated, formed out of the\n   bittern or leach brine.'),
(12431, 'Cats-eye', 'n.', 'A variety of quartz or chalcedony, exhibiting opalescent\n   reflections from within, like the eye of a cat. The name is given to\n   other gems affording like effects, esp. the chrysoberyl.'),
(12432, 'Catsos', 'pl. ', 'of Catso'),
(12433, 'Catso', 'n.', 'A base fellow; a rogue; a cheat.'),
(12434, 'Cats-paw', 'n.', 'A light transitory air which ruffles the surface of the\n   water during a calm, or the ripples made by such a puff of air.'),
(12435, 'Cats-paw', 'n.', 'A particular hitch or turn in the bight of a rope, into\n   which a tackle may be hooked.'),
(12436, 'Cats-paw', 'n.', 'A dupe; a tool; one who, or that which, is used by\n   another as an instrument to a accomplish his purposes.'),
(12437, 'Catstick', 'n.', 'A stick or club employed in the game of ball called cat\n   or tipcat.'),
(12438, 'Catsup', 'n.', 'Same as Catchup, and Ketchup.'),
(12439, 'Cat-tail', 'n.', 'A tall rush or flag (Typha latifolia) growing in marshes,\n   with long, flat leaves, and having its flowers in a close cylindrical\n   spike at the top of the stem. The leaves are frequently used for\n   seating chairs, making mats, etc. See Catkin.'),
(12440, 'Cattish', 'a.', 'Catlike; feline'),
(12441, 'Cattle', 'n. pl.', 'Quadrupeds of the Bovine family; sometimes, also,\n   including all domestic quadrupeds, as sheep, goats, horses, mules,\n   asses, and swine.'),
(12442, 'Catty', 'n.', 'An East Indian Weight of 1 1/3 pounds.'),
(12443, 'Caucus', 'n.', 'A meeting, especially a preliminary meeting, of persons\n   belonging to a party, to nominate candidates for public office, or to\n   select delegates to a nominating convention, or to confer regarding\n   measures of party policy; a political primary meeting.'),
(12444, 'Caucused', 'imp. & p. p.', 'of Caucus'),
(12445, 'Caucus', 'v. i.', 'To hold, or meet in, a caucus or caucuses.'),
(12446, 'Caudad', 'adv.', 'Backwards; toward the tail or posterior part.'),
(12447, 'Caudal', 'a.', 'Of the nature of, or pertaining to, a tail; having a\n   tail-like appendage.'),
(12448, 'Caudata', 'n. pl.', 'See Urodela.'),
(12449, 'Caudate', 'a.', 'Alt. of Caudated'),
(12450, 'Caudated', 'a.', 'Having a tail; having a termination like a tail.'),
(12451, 'Caudices', 'pl. ', 'of Caudex'),
(12452, 'Caudexes', 'pl. ', 'of Caudex'),
(12453, 'Caudex', 'n.', 'The stem of a tree., esp. a stem without a branch, as of a\n   palm or a tree fern; also, the perennial rootstock of an herbaceous\n   plant.'),
(12454, 'Caudicle', 'n.', 'Alt. of Caudicula'),
(12455, 'Caudle', 'n.', 'A kind of warm drink for sick persons, being a mixture of\n   wine with eggs, bread, sugar, and spices.'),
(12456, 'Caudled', 'imp. & p. p.', 'of Caudle'),
(12457, 'Caudling', 'p. pr. & vb. n.', 'of Caudle'),
(12458, 'Caudle', 'v. t.', 'To make into caudle.'),
(12459, 'Caudle', 'v. t.', 'Too serve as a caudle to; to refresh.'),
(12460, 'Caufle', 'n.', 'A gang of slaves. Same as Coffle.'),
(12461, 'Caught', '', 'imp. & p. p. of Catch.'),
(12462, 'Cauker', 'n.', 'See Cawk, Calker.'),
(12463, 'Caulicle', 'n.', 'A short caulis or stem, esp. the rudimentary stem seen in\n   the embryo of seed; -- otherwise called a radicle.'),
(12464, 'Cauline', 'a.', 'Growing immediately on a caulis; of or pertaining to a\n   caulis.'),
(12465, 'Caules', 'pl. ', 'of Caulis'),
(12466, 'Caulis', 'n.', 'An herbaceous or woody stem which bears leaves, and may\n   bear flowers.'),
(12467, 'Caulk', 'v. t. & n.', 'See Calk.'),
(12468, 'Cauma', 'n.', 'Great heat, as of the body in fever.'),
(12469, 'Causable', 'a.', 'Capable of being caused.'),
(12470, 'Causal', 'a.', 'Relating to a cause or causes; inplying or containing a\n   cause or causes; expressing a cause; causative.'),
(12471, 'Causal', 'n.', 'A causal word or form of speech.'),
(12472, 'Causally', 'adv.', 'According to the order or series of causes; by tracing\n   effects to causes.'),
(12473, 'Causally', 'n.', 'The lighter, earthy parts of ore, carried off washing.'),
(12474, 'Causator', 'n.', 'One who causes.'),
(12475, 'Cause', 'v.', 'That which produces or effects a result; that from which\n   anything proceeds, and without which it would not exist.'),
(12476, 'Cause', 'v.', 'That which is the occasion of an action or state; ground;\n   reason; motive; as, cause for rejoicing.'),
(12477, 'Cause', 'v.', 'Sake; interest; advantage.'),
(12478, 'Cause', 'v.', 'A suit or action in court; any legal process by which a\n   party endeavors to obtain his claim, or what he regards as his right;\n   case; ground of action.'),
(12479, 'Cause', 'v.', 'Any subject of discussion or debate; matter; question;\n   affair in general.'),
(12480, 'Cause', 'v.', 'The side of a question, which is espoused, advocated, and\n   upheld by a person or party; a principle which is advocated; that which\n   a person or party seeks to attain.'),
(12481, 'Caused', 'imp. & p. p.', 'of Cause'),
(12482, 'Causing', 'p. pr. & v. n.', 'of Cause'),
(12483, 'Cause', 'n.', 'To effect as an agent; to produce; to be the occasion of; to\n   bring about; to bring into existence; to make; -- usually followed by\n   an infinitive, sometimes by that with a finite verb.'),
(12484, 'Cause', 'v. i.', 'To assign or show cause; to give a reason; to make\n   excuse.'),
(12485, 'Cause', 'conj.', 'Abbreviation of Because.'),
(12486, 'Causeful', 'n.', 'Having a cause.'),
(12487, 'Causer', 'n.', 'One who or that which causes.'),
(12488, 'Causeuse', 'n.', 'A kind of sofa for two persons. A tete-/-tete.'),
(12489, 'Causeway', 'n.', 'Alt. of Causey'),
(12490, 'Causey', 'n.', 'A way or road raised above the natural level of the ground,\n   serving as a dry passage over wet or marshy ground.'),
(12491, 'Causeyed', 'a.', 'Having a raised way (causeway or causey); paved.'),
(12492, 'Caustic', 'a.', 'Alt. of Caustical'),
(12493, 'Caustic', 'a.', 'Any substance or means which, applied to animal or other\n   organic tissue, burns, corrodes, or destroys it by chemical action; an\n   escharotic.'),
(12494, 'Caustic', 'a.', 'A caustic curve or caustic surface.'),
(12495, 'Cautel', 'n.', 'Caution; prudence; wariness.'),
(12496, 'Cautel', 'n.', 'Craft; deceit; falseness.'),
(12497, 'Cauter', 'n.', 'A hot iron for searing or cauterizing.'),
(12498, 'Cautery', 'n.', 'A burning or searing, as of morbid flesh, with a hot iron,\n   or by application of a caustic that will burn, corrode, or destroy\n   animal tissue.'),
(12499, 'Cautery', 'n.', 'The iron of other agent in cauterizing.'),
(12500, 'Caution', 'n.', 'A careful attention to the probable effects of an act, in\n   order that failure or harm may be avoided; prudence in regard to\n   danger; provident care; wariness.'),
(12501, 'Caution', 'n.', 'Security; guaranty; bail.'),
(12502, 'Caution', 'n.', 'Precept or warning against evil of any kind; exhortation\n   to wariness; advice; injunction.'),
(12503, 'Caution', 'v. t.', 'To give notice of danger to; to warn; to exhort [one]\n   to take heed.'),
(12504, 'Cautious', 'a.', 'Attentive to examine probable effects and consequences of\n   acts with a view to avoid danger or misfortune; prudent; circumspect;\n   wary; watchful; as, a cautious general.'),
(12505, 'Cavalero', 'n.', 'Alt. of Cavaliero'),
(12506, 'Cavalier', 'n.', 'A military man serving on horseback; a knight.'),
(12507, 'Cavalier', 'n.', 'A gay, sprightly, military man; hence, a gallant.'),
(12508, 'Cavalier', 'n.', 'One of the court party in the time of king Charles I. as\n   contrasted with a Roundhead or an adherent of Parliament.'),
(12509, 'Cavalier', 'n.', 'A work of more than ordinary height, rising from the\n   level ground of a bastion, etc., and overlooking surrounding parts.'),
(12510, 'Cavalier', 'a.', 'Gay; easy; offhand; frank.'),
(12511, 'Cavalier', 'a.', 'High-spirited.'),
(12512, 'Cavalier', 'a.', 'Supercilious; haughty; disdainful; curt; brusque.'),
(12513, 'Cavalier', 'a.', 'Of or pertaining to the party of King Charles I.'),
(12514, 'Cavally', 'n.', 'A carangoid fish of the Atlantic coast (Caranx hippos): --\n   called also horse crevalle. [See Illust. under Carangoid.]'),
(12515, 'Cavalry', 'n.', 'That part of military force which serves on horseback.'),
(12516, 'Cavatina', 'n.', 'Originally, a melody of simpler form than the aria; a\n   song without a second part and a da capo; -- a term now variously and\n   vaguely used.'),
(12517, 'Caved', 'imp. & p. p.', 'of Cave'),
(12518, 'Caving', 'p. pr. & vb. n.', 'of Cave'),
(12519, 'Caveat', 'n.', 'A notice given by an interested party to some officer not\n   to do a certain act until the party is heard in opposition; as, a\n   caveat entered in a probate court to stop the proving of a will or the\n   taking out of letters of administration, etc.'),
(12520, 'Caveat', 'n.', 'A description of some invention, designed to be patented,\n   lodged in the patent office before the patent right is applied for, and\n   operating as a bar to the issue of letters patent to any other person,\n   respecting the same invention.'),
(12521, 'Caveat', 'n.', 'Intimation of caution; warning; protest.'),
(12522, 'Caveator', 'n.', 'One who enters a caveat.'),
(12523, 'Cavern', 'n.', 'A large, deep, hollow place in the earth; a large cave.'),
(12524, 'Caverned', 'a.', 'Containing caverns.'),
(12525, 'Caverned', 'a.', 'Living in a cavern.'),
(12526, 'Cavesson', 'n.', 'Alt. of Cavezon'),
(12527, 'Cavezon', 'n.', 'A kind of noseband used in breaking and training horses.'),
(12528, 'Cavetto', 'n.', 'A concave molding; -- used chiefly in classical\n   architecture. See Illust. of Column.'),
(12529, 'Caviare', 'n.', 'Alt. of Caviar'),
(12530, 'Caviar', 'n.', 'The roes of the sturgeon, prepared and salted; -- used as a\n   relish, esp. in Russia.'),
(12531, 'Cavicorn', 'a.', 'Having hollow horns.'),
(12532, 'Caviled', 'imp. & p. p.', 'of Cavil'),
(12533, 'Cavilled', '', 'of Cavil'),
(12534, 'Caviling', 'p. pr. & vb. n.', 'of Cavil'),
(12535, 'Cavil', 'v. i.', 'To raise captious and frivolous objections; to find fault\n   without good reason.'),
(12536, 'Cavil', 'v. t.', 'To cavil at.'),
(12537, 'Cavil', 'n.', 'A captious or frivolous objection.'),
(12538, 'Caviler', 'n.', 'Alt. of Caviller'),
(12539, 'Caviller', 'n.', 'One who cavils.'),
(12540, 'Caviling', 'a.', 'Disposed to cavil; finding fault without good reason. See\n   Captious.'),
(12541, 'Cavilous', 'a.', 'Alt. of Cavillous'),
(12542, 'Cavin', 'n.', 'A hollow way, adapted to cover troops, and facilitate their\n   aproach to a place.'),
(12543, 'Cavitary', 'a.', 'Containing a body cavity; as, the cavitary or nematoid\n   worms.'),
(12544, 'Cavities', 'pl. ', 'of Cavity'),
(12545, 'Cavity', 'n.', 'Hollowness.'),
(12546, 'Cavity', 'n.', 'A hollow place; a hollow; as, the abdominal cavity.'),
(12547, 'Cavorted', 'imp. & p. p.', 'of Cavort'),
(12548, 'Cavort', 'v. i.', 'To prance ostentatiously; -- said of a horse or his\n   rider.'),
(12549, 'Cavies', 'pl. ', 'of Cavy'),
(12550, 'Cawed', 'imp. & p. p.', 'of Caw'),
(12551, 'Cawing', 'p. pr. & vb. n.', 'of Caw'),
(12552, 'Cawker', 'n.', 'See Calker.'),
(12553, 'Cawky', 'a.', 'Of or pertaining to cawk; like cawk.'),
(12554, 'Caxon', 'n.', 'A kind of wig.'),
(12555, 'Caxton', 'n.', 'Any book printed by William Caxton, the first English\n   printer.'),
(12556, 'Cayenne', 'n.', 'Cayenne pepper.'),
(12557, 'Cayman', 'n.', 'The south America alligator. See Alligator.'),
(12558, 'Cayugas', 'n. pl.', 'A tribe of Indians formerly inhabiting western\n   New-York, forming part of the confederacy called the Five Nations.'),
(12559, 'Cayuse', 'n.', 'An Indian pony.'),
(12560, 'Cazique', 'n.', 'Alt. of Cazic'),
(12561, 'Cazic', 'n.', 'A chief or petty king among some tribes of Indians in\n   America.'),
(12562, 'Ceased', 'imp. & p. p.', 'of Cease'),
(12563, 'Ceasing', 'p. pr. & vb. n.', 'of Cease'),
(12564, 'Cease', 'v. i.', 'To come to an end; to stop; to leave off or give over; to\n   desist; as, the noise ceased.'),
(12565, 'Cease', 'v. i.', 'To be wanting; to fail; to pass away.'),
(12566, 'Cease', 'v. t.', 'To put a stop to; to bring to an end.'),
(12567, 'Cease', 'n.', 'Extinction.'),
(12568, 'Cecity', 'n.', 'Blindness.'),
(12569, 'Cedar', 'n.', 'The name of several evergreen trees. The wood is remarkable\n   for its durability and fragrant odor.'),
(12570, 'Cedar', 'a.', 'Of or pertaining to cedar.'),
(12571, 'Cedared', 'a.', 'Covered, or furnished with, cedars.'),
(12572, 'Cedarn', 'a.', 'Of or pertaining to the cedar or its wood.'),
(12573, 'Ceded', 'imp. & p. p.', 'of Cede'),
(12574, 'Ceding', 'p. pr. & vb. n.', 'of Cede'),
(12575, 'Cedilla', 'n.', 'A mark placed under the letter c [thus, c], to show that\n   it is to be sounded like s, as in facade.'),
(12576, 'Cedrat', 'n.', 'Properly the citron, a variety of Citrus medica, with large\n   fruits, not acid, and having a high perfume.'),
(12577, 'Cedrene', 'n.', 'A rich aromatic oil, C15H24, extracted from oil of red\n   cedar, and regarded as a polymeric terpene; also any one of a class of\n   similar substances, as the essential oils of cloves, cubebs, juniper,\n   etc., of which cedrene proper is the type.'),
(12578, 'Cedrine', 'a.', 'Of or pertaining to cedar or the cedar tree.'),
(12579, 'Cedriret', 'n.', 'Same as Coerulignone.'),
(12580, 'Cedry', 'a.', 'Of the nature of cedar.'),
(12581, 'Cedule', 'n.', 'A scroll; a writing; a schedule.'),
(12582, 'Ceduous', 'a.', 'Fit to be felled.'),
(12583, 'Ceiled', 'imp. & p. p.', 'of Ceil'),
(12584, 'Ceiling', 'p. pr. & vb. n.', 'of Ceil'),
(12585, 'Ceiling', 'v. t.', 'The inside lining of a room overhead; the under side of\n   the floor above; the upper surface opposite to the floor.'),
(12586, 'Ceiling', 'v. t.', 'The lining or finishing of any wall or other surface,\n   with plaster, thin boards, etc.; also, the work when done.'),
(12587, 'Ceiling', 'v. t.', 'The inner planking of a vessel.'),
(12588, 'Ceint', 'n.', 'A girdle.'),
(12589, 'Celadon', 'n.', 'A pale sea-green color; also, porcelain or fine pottery of\n   this tint.'),
(12590, 'Celature', 'n.', 'The act or art of engraving or embossing.'),
(12591, 'Celature', 'n.', 'That which is engraved.'),
(12592, 'Celeriac', 'n.', 'Turnip-rooted celery, a from of celery with a large\n   globular root, which is used for food.'),
(12593, 'Celerity', 'n.', 'Rapidity of motion; quickness; swiftness.'),
(12594, 'Celery', 'n.', 'A plant of the Parsley family (Apium graveolens), of which\n   the blanched leafstalks are used as a salad.'),
(12595, 'Celiac', 'a.', 'See Coellac.'),
(12596, 'Celibacy', 'n.', 'The state of being unmarried; single life, esp. that of a\n   bachelor, or of one bound by vows not to marry.'),
(12597, 'Celibate', 'n.', 'Celibate state; celibacy.'),
(12598, 'Celibate', 'n.', 'One who is unmarried, esp. a bachelor, or one bound by\n   vows not to marry.'),
(12599, 'Celibate', 'a.', 'Unmarried; single; as, a celibate state.'),
(12600, 'Celled', 'imp. & p. p.', 'of Cell'),
(12601, 'Cella', 'n.', 'The part inclosed within the walls of an ancient temple, as\n   distinguished from the open porticoes.'),
(12602, 'Cellar', 'n.', 'A room or rooms under a building, and usually below the\n   surface of the ground, where provisions and other stores are kept.'),
(12603, 'Cellarer', 'n.', 'A steward or butler of a monastery or chapter; one who\n   has charge of procuring and keeping the provisions.'),
(12604, 'Cellaret', 'n.', 'A receptacle, as in a dining room, for a few bottles of\n   wine or liquor, made in the form of a chest or coffer, or a deep drawer\n   in a sideboard, and usually lined with metal.'),
(12605, 'Celled', 'a.', 'Containing a cell or cells.'),
(12606, 'Cellos', 'pl. ', 'of Cello'),
(12607, 'Celli', 'pl. ', 'of Cello'),
(12608, 'Cello', 'n.', 'A contraction for Violoncello.'),
(12609, 'Cellular', 'a.', 'Consisting of, or containing, cells; of or pertaining to\n   a cell or cells.'),
(12610, 'Cellule', 'n.', 'A small cell.'),
(12611, 'Celotomy', 'n.', 'The act or operation of cutting, to relieve the structure\n   in strangulated hernia.'),
(12612, 'Celsius', 'n.', 'The Celsius thermometer or scale, so called from Anders\n   Celsius, a Swedish astronomer, who invented it. It is the same as the\n   centigrade thermometer or scale.'),
(12613, 'Celtic', 'a.', 'Of or pertaining to the Celts; as, Celtic people, tribes,\n   literature, tongue.'),
(12614, 'Celtic', 'n.', 'The language of the Celts.'),
(12615, 'Cembalo', 'n.', 'An old name for the harpsichord.'),
(12616, 'Cement', 'n.', 'Any substance used for making bodies adhere to each other,\n   as mortar, glue, etc.'),
(12617, 'Cement', 'n.', 'A kind of calcined limestone, or a calcined mixture of clay\n   and lime, for making mortar which will harden under water.'),
(12618, 'Cement', 'n.', 'The powder used in cementation. See Cementation, n., 2.'),
(12619, 'Cement', 'n.', 'Bond of union; that which unites firmly, as persons in\n   friendship, or men in society.'),
(12620, 'Cement', 'n.', 'The layer of bone investing the root and neck of a tooth;\n   -- called also cementum.'),
(12621, 'Cemented', 'imp. & p. p.', 'of Cement'),
(12622, 'Cement', 'n.', 'To unite or cause to adhere by means of a cement.'),
(12623, 'Cement', 'n.', 'To unite firmly or closely.'),
(12624, 'Cement', 'n.', 'To overlay or coat with cement; as, to cement a cellar\n   bottom.'),
(12625, 'Cement', 'v. i.', 'To become cemented or firmly united; to cohere.'),
(12626, 'Cemental', 'a.', 'Of or pertaining to cement, as of a tooth; as, cemental\n   tubes.'),
(12627, 'Cementer', 'n.', 'A person or thing that cements.'),
(12628, 'Cemetery', 'n.', 'A place or ground set apart for the burial of the dead; a\n   graveyard; a churchyard; a necropolis.'),
(12629, 'Cenanthy', 'n.', 'The absence or suppression of the essential organs\n   (stamens and pistil) in a flower.'),
(12630, 'Cenation', 'n.', 'Meal-taking; dining or supping.'),
(12631, 'Cenatory', 'a.', 'Of or pertaining to dinner or supper.'),
(12632, 'Cenobite', 'n.', 'One of a religious order, dwelling in a convent, or a\n   community, in opposition to an anchoret, or hermit, who lives in\n   solitude.'),
(12633, 'Cenogamy', 'n.', 'The state of a community which permits promiscuous sexual\n   intercourse among its members, as in certain societies practicing\n   communism.'),
(12634, 'Cenotaph', 'n.', 'An empty tomb or a monument erected in honor of a person\n   who is buried elsewhere.'),
(12635, 'Cenozoic', 'a.', 'Belonging to the most recent division of geological time,\n   including the tertiary, or Age of mammals, and the Quaternary, or Age\n   of man. [Written also caenozoic, cainozoic, kainozoic.] See Geology.'),
(12636, 'Cense', 'n.', 'A census; -- also, a public rate or tax.'),
(12637, 'Cense', 'n.', 'Condition; rank.'),
(12638, 'Censed', 'imp. & p. p.', 'of Cense'),
(12639, 'Censing', 'p. pr. & vb. n.', 'of Cense'),
(12640, 'Cense', 'v. t.', 'To perfume with odors from burning gums and spices.'),
(12641, 'Cense', 'v. i.', 'To burn or scatter incense.'),
(12642, 'Censer', 'n.', 'A vessel for perfumes; esp. one in which incense is burned.'),
(12643, 'Censor', 'n.', 'One of two magistrates of Rome who took a register of the\n   number and property of citizens, and who also exercised the office of\n   inspector of morals and conduct.'),
(12644, 'Censor', 'n.', 'One who is empowered to examine manuscripts before they are\n   committed to the press, and to forbid their publication if they contain\n   anything obnoxious; -- an official in some European countries.'),
(12645, 'Censor', 'n.', 'One given to fault-finding; a censurer.'),
(12646, 'Censor', 'n.', 'A critic; a reviewer.'),
(12647, 'Censual', 'a.', 'Relating to, or containing, a census.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(12648, 'Censure', 'n.', 'Judgment either favorable or unfavorable; opinion.'),
(12649, 'Censure', 'n.', 'The act of blaming or finding fault with and condemning as\n   wrong; reprehension; blame.'),
(12650, 'Censure', 'n.', 'Judicial or ecclesiastical sentence or reprimand;\n   condemnatory judgment.'),
(12651, 'Censured', 'imp. & p. p.', 'of Censure'),
(12652, 'Censure', 'v. i.', 'To form or express a judgment in regard to; to\n   estimate; to judge.'),
(12653, 'Censure', 'v. i.', 'To find fault with and condemn as wrong; to blame; to\n   express disapprobation of.'),
(12654, 'Censure', 'v. i.', 'To condemn or reprimand by a judicial or ecclesiastical\n   sentence.'),
(12655, 'Censure', 'v. i.', 'To judge.'),
(12656, 'Censurer', 'n.', 'One who censures.'),
(12657, 'Census', 'n.', 'A numbering of the people, and valuation of their estate,\n   for the purpose of imposing taxes, etc.; -- usually made once in five\n   years.'),
(12658, 'Census', 'n.', 'An official registration of the number of the people, the\n   value of their estates, and other general statistics of a country.'),
(12659, 'Centage', 'n.', 'Rate by the hundred; percentage.'),
(12660, 'Cental', 'n.', 'A weight of one hundred pounds avoirdupois; -- called in\n   many parts of the United States a Hundredweight.'),
(12661, 'Cental', 'n.', 'Relating to a hundred.'),
(12662, 'Centare', 'n.', 'A measure of area, the hundredth part of an are; one\n   square meter, or about 1/ square yards.'),
(12663, 'Centaur', 'n.', 'A fabulous being, represented as half man and half horse.'),
(12664, 'Centaur', 'n.', 'A constellation in the southern heavens between Hydra and\n   the Southern Cross.'),
(12665, 'Centaury', 'n.', 'A gentianaceous plant not fully identified. The name is\n   usually given to the Erytheraea Centaurium and the Chlora perfoliata of\n   Europe, but is also extended to the whole genus Sabbatia, and even to\n   the unrelated Centaurea.'),
(12666, 'Center', 'n.', 'A point equally distant from the extremities of a line,\n   figure, or body, or from all parts of the circumference of a circle;\n   the middle point or place.'),
(12667, 'Center', 'n.', 'The middle or central portion of anything.'),
(12668, 'Center', 'n.', 'A principal or important point of concentration; the\n   nucleus around which things are gathered or to which they tend; an\n   object of attention, action, or force; as, a center of attaction.'),
(12669, 'Center', 'n.', 'The earth.'),
(12670, 'Center', 'n.', 'Those members of a legislative assembly (as in France) who\n   support the existing government. They sit in the middle of the\n   legislative chamber, opposite the presiding officer, between the\n   conservatives or monarchists, who sit on the right of the speaker, and\n   the radicals or advanced republicans who occupy the seats on his left,\n   See Right, and Left.'),
(12671, 'Center', 'n.', 'A temporary structure upon which the materials of a vault\n   or arch are supported in position until the work becomes\n   self-supporting.'),
(12672, 'Center', 'n.', 'One of the two conical steel pins, in a lathe, etc., upon\n   which the work is held, and about which it revolves.'),
(12673, 'Center', 'n.', 'A conical recess, or indentation, in the end of a shaft or\n   other work, to receive the point of a center, on which the work can\n   turn, as in a lathe.'),
(12674, 'Centered', 'imp. & p. p.', 'of Centre'),
(12675, 'Centred', '', 'of Centre'),
(12676, 'Centring', '', 'of Centre'),
(12677, 'Center', 'v. i.', 'Alt. of Centre'),
(12678, 'Centre', 'v. i.', 'To be placed in a center; to be central.'),
(12679, 'Centre', 'v. i.', 'To be collected to a point; to be concentrated; to rest\n   on, or gather about, as a center.'),
(12680, 'Center', 'v. t.', 'Alt. of Centre'),
(12681, 'Centre', 'v. t.', 'To place or fix in the center or on a central point.'),
(12682, 'Centre', 'v. t.', 'To collect to a point; to concentrate.'),
(12683, 'Centre', 'v. t.', 'To form a recess or indentation for the reception of a\n   center.'),
(12684, 'Centesm', 'n.', 'Hundredth.'),
(12685, 'Centiare', 'n.', 'See centare.'),
(12686, 'Centime', 'n.', 'The hundredth part of a franc; a small French copper coin\n   and money of account.'),
(12687, 'Centinel', 'n.', 'Sentinel.'),
(12688, 'Centiped', 'n.', 'A species of the Myriapoda; esp. the large, flattened,\n   venomous kinds of the order Chilopoda, found in tropical climates. they\n   are many-jointed, and have a great number of feet.'),
(12689, 'Centner', 'n.', 'A weight divisible first into a hundred parts, and then\n   into smaller parts.'),
(12690, 'Centner', 'n.', 'The commercial hundredweight in several of the continental\n   countries, varying in different places from 100 to about 112 pounds.'),
(12691, 'Centos', 'pl. ', 'of Cento'),
(12692, 'Cento', 'n.', 'A literary or a musical composition formed by selections\n   from different authors disposed in a new order.'),
(12693, 'Central', 'a.', 'Relating to the center; situated in or near the center or\n   middle; containing the center; of or pertaining to the parts near the\n   center; equidistant or equally accessible from certain points.'),
(12694, 'Central', 'n.', 'Alt. of Centrale'),
(12695, 'Centrale', 'n.', 'The central, or one of the central, bones of the carpus\n   or or tarsus. In the tarsus of man it is represented by the navicular.'),
(12696, 'Centre', 'n. & v.', 'See Center.'),
(12697, 'Centric', 'a.', 'Alt. of Centrical'),
(12698, 'Centring', 'n.', 'See Centring.'),
(12699, 'Centrode', 'n.', 'In two figures having relative motion, one of the two\n   curves which are the loci of the instantaneous center.'),
(12700, 'Centroid', 'n.', 'The center of mass, inertia, or gravity of a body or\n   system of bodies.'),
(12701, 'Centrums', 'pl. ', 'of Centrum'),
(12702, 'Centra', 'pl. ', 'of Centrum'),
(12703, 'Centrum', 'n.', 'The body, or axis, of a vertebra. See Vertebra.'),
(12704, 'Centry', 'n.', 'See Sentry.'),
(12705, 'Centuple', 'a.', 'Hundredfold.'),
(12706, 'Centuple', 'v. t.', 'To increase a hundredfold.'),
(12707, 'Century', 'n.', 'A hundred; as, a century of sonnets; an aggregate of a\n   hundred things.'),
(12708, 'Century', 'n.', 'A period of a hundred years; as, this event took place\n   over two centuries ago.'),
(12709, 'Century', 'n.', 'A division of the Roman people formed according to their\n   property, for the purpose of voting for civil officers.'),
(12710, 'Century', 'n.', 'One of sixty companies into which a legion of the army was\n   divided. It was Commanded by a centurion.'),
(12711, 'Cephalad', 'adv.', 'Forwards; towards the head or anterior extremity of the\n   body; opposed to caudad.'),
(12712, 'Cephalic', 'a.', 'Of or pertaining to the head. See the Note under\n   Anterior.'),
(12713, 'Cephalic', 'n.', 'A medicine for headache, or other disorder in the head.'),
(12714, 'Cephalo', '', 'A combining form denoting the head, of the head, connected\n   with the head; as, cephalosome, cephalopod.'),
(12715, 'Cephalon', 'n.', 'The head.'),
(12716, 'Cepheus', 'n.', 'A northern constellation near the pole. Its head, which is\n   in the Milky Way, is marked by a triangle formed by three stars of the\n   fourth magnitude. See Cassiopeia.'),
(12717, 'Cerago', 'n.', 'Beebread.'),
(12718, 'Ceramic', 'a.', 'Of or pertaining to pottery; relating to the art of making\n   earthenware; as, ceramic products; ceramic ornaments for ceilings.'),
(12719, 'Ceramics', 'n.', 'The art of making things of baked clay; as pottery,\n   tiles, etc.'),
(12720, 'Ceramics', 'n.', 'Work formed of clay in whole or in part, and baked; as,\n   vases, urns, etc.'),
(12721, 'Cerasin', 'n.', 'A white amorphous substance, the insoluble part of cherry\n   gum; -- called also meta-arabinic acid.'),
(12722, 'Cerasin', 'n.', 'A gummy mucilaginous substance; -- called also bassorin,\n   tragacanthin, etc.'),
(12723, 'Cerastes', 'n.', 'A genus of poisonous African serpents, with a horny scale\n   over each eye; the horned viper.'),
(12724, 'Cerate', 'n.', 'An unctuous preparation for external application, of a\n   consistence intermediate between that of an ointment and a plaster, so\n   that it can be spread upon cloth without the use of heat, but does not\n   melt when applied to the skin.'),
(12725, 'Cerated', 'p. a.', 'Covered with wax.'),
(12726, 'Ceratine', 'a.', 'Sophistical.'),
(12727, 'Cerberus', 'n.', 'A monster, in the shape of a three-headed dog, guarding\n   the entrance into the infernal regions, Hence: Any vigilant custodian\n   or guardian, esp. if surly.'),
(12728, 'Cerberus', 'n.', 'A genus of East Indian serpents, allied to the pythons;\n   the bokadam.'),
(12729, 'Cercal', 'a.', 'Of or pertaining to the tail.'),
(12730, 'Cercarle', 'pl. ', 'of Cercaria'),
(12731, 'Cercaria', 'n.', 'The larval form of a trematode worm having the shape of a\n   tadpole, with its body terminated by a tail-like appendage.'),
(12732, 'Cercopod', 'n.', 'One of the jointed antenniform appendages of the\n   posterior somites of certain insects.'),
(12733, 'Cerci', 'pl. ', 'of Cercus'),
(12734, 'Cercus', 'n.', 'See Cercopod.'),
(12735, 'Cered', 'imp. & p. p.', 'of Cere'),
(12736, 'Cering', 'p. pr. & vb. n.', 'of Cere'),
(12737, 'Cereal', 'a.', 'Of or pertaining to the grasses which are cultivated for\n   their edible seeds (as wheat, maize, rice, etc.), or to their seeds or\n   grain.'),
(12738, 'Cereal', 'n.', 'Any grass cultivated for its edible grain, or the grain\n   itself; -- usually in the plural.'),
(12739, 'Cerealia', 'n. pl.', 'Public festivals in honor of Ceres.'),
(12740, 'Cerealia', 'n. pl.', 'The cereals.'),
(12741, 'Cerealin', 'n.', 'A nitrogenous substance closely resembling diastase,\n   obtained from bran, and possessing the power of converting starch into\n   dextrin, sugar, and lactic acid.'),
(12742, 'Cerebel', 'n.', 'The cerebellum.'),
(12743, 'Cerebral', 'a.', 'Of or pertaining to the cerebrum.'),
(12744, 'Cerebral', 'n.', 'One of a class of lingual consonants in the East Indian\n   languages. See Lingual, n.'),
(12745, 'Cerebric', 'a.', 'Of, pertaining to, or derived from, the brain.'),
(12746, 'Cerebrin', 'n.', 'A nonphosphorized, nitrogenous substance, obtained from\n   brain and nerve tissue by extraction with boiling alcohol. It is\n   uncertain whether it exists as such in nerve tissue, or is a product of\n   the decomposition of some more complex substance.'),
(12747, 'Cerebra', 'pl. ', 'of Cerebrum'),
(12748, 'Cerebrum', 'n.', 'The anterior, and in man the larger, division of the\n   brain; the seat of the reasoning faculties and the will. See Brain.'),
(12749, 'Cerement', 'n.', 'A cerecloth used for the special purpose of enveloping a\n   dead body when embalmed.'),
(12750, 'Cerement', 'n.', 'Any shroud or wrapping for the dead.'),
(12751, 'Ceremony', 'n.', 'Ar act or series of acts, often of a symbolical\n   character, prescribed by law, custom, or authority, in the conduct of\n   important matters, as in the performance of religious duties, the\n   transaction of affairs of state, and the celebration of notable events;\n   as, the ceremony of crowning a sovereign; the ceremonies observed in\n   consecrating a church; marriage and baptismal ceremonies.'),
(12752, 'Ceremony', 'n.', 'Behavior regulated by strict etiquette; a formal method\n   of performing acts of civility; forms of civility prescribed by custom\n   or authority.'),
(12753, 'Ceremony', 'n.', 'A ceremonial symbols; an emblem, as a crown, scepter,\n   garland, etc.'),
(12754, 'Ceremony', 'n.', 'A sign or prodigy; a portent.'),
(12755, 'Cereous', 'a.', 'Waxen; like wax.'),
(12756, 'Ceres', 'n.', 'The daughter of Saturn and Ops or Rhea, the goddess of corn\n   and tillage.'),
(12757, 'Ceres', 'n.', 'The first discovered asteroid.'),
(12758, 'Ceresin', 'n.', 'A white wax, made by bleaching and purifying ozocerite,\n   and used as a substitute for beeswax.'),
(12759, 'Cereus', 'n.', 'A genus of plants of the Cactus family. They are natives of\n   America, from California to Chili.'),
(12760, 'Cerial', 'a.', 'Same as Cerrial.'),
(12761, 'Cerin', 'n.', 'A waxy substance extracted by alcohol or ether from cork;\n   sometimes applied also to the portion of beeswax which is soluble in\n   alcohol.'),
(12762, 'Cerin', 'n.', 'A variety of the mineral allanite.'),
(12763, 'Ceriph', 'n.', 'One of the fine lines of a letter, esp. one of the fine\n   cross strokes at the top and bottom of letters.'),
(12764, 'Cerise', 'a.', 'Cherry-colored; a light bright red; -- applied to textile\n   fabrics, especially silk.'),
(12765, 'Cerite', 'n.', 'A gastropod shell belonging to the family Cerithiidae; --\n   so called from its hornlike form.'),
(12766, 'Cerite', 'n.', 'A mineral of a brownish of cherry-red color, commonly\n   massive. It is a hydrous silicate of cerium and allied metals.'),
(12767, 'Cerium', 'n.', 'A rare metallic element, occurring in the minerals cerite,\n   allanite, monazite, etc. Symbol Ce. Atomic weight 141.5. It resembles\n   iron in color and luster, but is soft, and both malleable and ductile.\n   It tarnishes readily in the air.'),
(12768, 'Cernuous', 'a.', 'Inclining or nodding downward; pendulous; drooping; --\n   said of a bud, flower, fruit, or the capsule of a moss.'),
(12769, 'Cerolite', 'n.', 'A hydrous silicate of magnesium, allied to serpentine,\n   occurring in waxlike masses of a yellow or greenish color.'),
(12770, 'Ceroma', 'n.', 'The unguent (a composition of oil and wax) with which\n   wrestlers were anointed among the ancient Romans.'),
(12771, 'Ceroma', 'n.', 'That part of the baths and gymnasia in which bathers and\n   wrestlers anointed themselves.'),
(12772, 'Ceroma', 'n.', 'The cere of birds.'),
(12773, 'Ceroon', 'n.', 'A bale or package. covered with hide, or with wood bound\n   with hide; as, a ceroon of indigo, cochineal, etc.'),
(12774, 'Cerosin', 'n.', 'A waxy substance obtained from the bark of the sugar cane,\n   and crystallizing in delicate white laminae.'),
(12775, 'Cerote', 'n.', 'See Cerate.'),
(12776, 'Cerotene', 'n.', 'A white waxy solid obtained from Chinese wax, and by the\n   distillation of cerotin.'),
(12777, 'Cerotic', 'a.', 'Pertaining to, or derived from, beeswax or Chinese wax;\n   as, cerotic acid or alcohol.'),
(12778, 'Cerotin', 'n.', 'A white crystalline substance, C27H55.OH, obtained from\n   Chinese wax, and regarded as an alcohol of the marsh gas series; --\n   called also cerotic alcohol, ceryl alcohol.'),
(12779, 'Cerrial', 'a.', 'Of or pertaining to the cerris.'),
(12780, 'Cerris', 'n.', 'A species of oak (Quercus cerris) native in the Orient and\n   southern Europe; -- called also bitter oak and Turkey oak.'),
(12781, 'Certain', 'a.', 'Assured in mind; having no doubts; free from suspicions\n   concerning.'),
(12782, 'Certain', 'a.', 'Determined; resolved; -- used with an infinitive.'),
(12783, 'Certain', 'a.', 'Not to be doubted or denied; established as a fact.'),
(12784, 'Certain', 'a.', 'Actually existing; sure to happen; inevitable.'),
(12785, 'Certain', 'a.', 'Unfailing; infallible.'),
(12786, 'Certain', 'a.', 'Fixed or stated; regular; determinate.'),
