(13022, 'Chancre', 'n.', 'A venereal sore or ulcer; specifically, the initial lesion\n   of true syphilis, whether forming a distinct ulcer or not; -- called\n   also hard chancre, indurated chancre, and Hunterian chancre.'),
(13023, 'Chandler', 'n.', 'A maker or seller of candles.'),
(13024, 'Chandler', 'n.', 'A dealer in other commodities, which are indicated by a\n   word prefixed; as, ship chandler, corn chandler.'),
(13025, 'Chandoo', 'n.', 'An extract or preparation of opium, used in China and\n   India for smoking.'),
(13026, 'Chandry', 'n.', 'Chandlery.'),
(13027, 'Chanfrin', 'n.', 'The fore part of a horse\'s head.'),
(13028, 'Changed', 'imp. & p. p.', 'of Change'),
(13029, 'Changing', 'p. pr. & vb. n.', 'of Change'),
(13030, 'Change', 'v. t.', 'To alter; to make different; to cause to pass from one\n   state to another; as, to change the position, character, or appearance\n   of a thing; to change the countenance.'),
(13031, 'Change', 'v. t.', 'To alter by substituting something else for, or by\n   giving up for something else; as, to change the clothes; to change\n   one\'s occupation; to change one\'s intention.'),
(13032, 'Change', 'v. t.', 'To give and take reciprocally; to exchange; -- followed\n   by with; as, to change place, or hats, or money, with another.'),
(13033, 'Change', 'v. t.', 'Specifically: To give, or receive, smaller denominations\n   of money (technically called change) for; as, to change a gold coin or\n   a bank bill.'),
(13034, 'Change', 'v. i.', 'To be altered; to undergo variation; as, men sometimes\n   change for the better.'),
(13035, 'Change', 'v. i.', 'To pass from one phase to another; as, the moon changes\n   to-morrow night.'),
(13036, 'Change', 'v. t.', 'Any variation or alteration; a passing from one state or\n   form to another; as, a change of countenance; a change of habits or\n   principles.'),
(13037, 'Change', 'v. t.', 'A succesion or substitution of one thing in the place of\n   another; a difference; novelty; variety; as, a change of seasons.'),
(13038, 'Change', 'v. t.', 'A passing from one phase to another; as, a change of the\n   moon.'),
(13039, 'Change', 'v. t.', 'Alteration in the order of a series; permutation.'),
(13040, 'Change', 'v. t.', 'That which makes a variety, or may be substituted for\n   another.'),
(13041, 'Change', 'v. t.', 'Small money; the money by means of which the larger\n   coins and bank bills are made available in small dealings; hence, the\n   balance returned when payment is tendered by a coin or note exceeding\n   the sum due.'),
(13042, 'Change', 'v. t.', 'A place where merchants and others meet to transact\n   business; a building appropriated for mercantile transactions.'),
(13043, 'Change', 'v. t.', 'A public house; an alehouse.'),
(13044, 'Change', 'v. t.', 'Any order in which a number of bells are struck, other\n   than that of the diatonic scale.'),
(13045, 'Changer', 'n.', 'One who changes or alters the form of anything.'),
(13046, 'Changer', 'n.', 'One who deals in or changes money.'),
(13047, 'Changer', 'n.', 'One apt to change; an inconstant person.'),
(13048, 'Chank', 'n.', 'The East Indian name for the large spiral shell of several\n   species of sea conch much used in making bangles, esp. Turbinella\n   pyrum. Called also chank chell.'),
(13049, 'Channel', 'n.', 'The hollow bed where a stream of water runs or may run.'),
(13050, 'Channel', 'n.', 'The deeper part of a river, harbor, strait, etc., where\n   the main current flows, or which affords the best and safest passage\n   for vessels.'),
(13051, 'Channel', 'n.', 'A strait, or narrow sea, between two portions of lands;\n   as, the British Channel.'),
(13052, 'Channel', 'n.', 'That through which anything passes; means of passing,\n   conveying, or transmitting; as, the news was conveyed to us by\n   different channels.'),
(13053, 'Channel', 'n.', 'A gutter; a groove, as in a fluted column.'),
(13054, 'Channel', 'n.', 'Flat ledges of heavy plank bolted edgewise to the outside\n   of a vessel, to increase the spread of the shrouds and carry them clear\n   of the bulwarks.'),
(13055, 'Channel', 'v. t.', 'To form a channel in; to cut or wear a channel or\n   channels in; to groove.'),
(13056, 'Channel', 'v. t.', 'To course through or over, as in a channel.'),
(13057, 'Chanson', 'n.', 'A song.'),
(13058, 'Chanted', 'imp. & p. p.', 'of Chant'),
(13059, 'Chanting', 'p. pr. & vb. n.', 'of Chant'),
(13060, 'Chant', 'v. t.', 'To utter with a melodious voice; to sing.'),
(13061, 'Chant', 'v. t.', 'To celebrate in song.'),
(13062, 'Chant', 'v. t.', 'To sing or recite after the manner of a chant, or to a\n   tune called a chant.'),
(13063, 'Chant', 'v. i.', 'To make melody with the voice; to sing.'),
(13064, 'Chant', 'v. i.', 'To sing, as in reciting a chant.'),
(13065, 'Chant', 'v. t.', 'Song; melody.'),
(13066, 'Chant', 'v. t.', 'A short and simple melody, divided into two parts by\n   double bars, to which unmetrical psalms, etc., are sung or recited. It\n   is the most ancient form of choral music.'),
(13067, 'Chant', 'v. t.', 'A psalm, etc., arranged for chanting.'),
(13068, 'Chant', 'v. t.', 'Twang; manner of speaking; a canting tone.'),
(13069, 'Chantant', 'a.', 'Composed in a melodious and singing style.'),
(13070, 'Chanter', 'n.', 'One who chants; a singer or songster.'),
(13071, 'Chanter', 'n.', 'The chief singer of the chantry.'),
(13072, 'Chanter', 'n.', 'The flute or finger pipe in a bagpipe. See Bagpipe.'),
(13073, 'Chanter', 'n.', 'The hedge sparrow.'),
(13074, 'Chanting', 'n.', 'Singing, esp. as a chant is sung.'),
(13075, 'Chantor', 'n.', 'A chanter.'),
(13076, 'Chantry', 'n.', 'An endowment or foundation for the chanting of masses and\n   offering of prayers, commonly for the founder.'),
(13077, 'Chantry', 'n.', 'A chapel or altar so endowed.'),
(13078, 'Chaos', 'n.', 'An empty, immeasurable space; a yawning chasm.'),
(13079, 'Chaos', 'n.', 'The confused, unorganized condition or mass of matter before\n   the creation of distinct and orderly forms.'),
(13080, 'Chaos', 'n.', 'Any confused or disordered collection or state of things; a\n   confused mixture; confusion; disorder.'),
(13081, 'Chaotic', 'a.', 'Resembling chaos; confused.'),
(13082, 'Chapped', 'imp. & p. p.', 'of Chap'),
(13083, 'Chapping', 'p. pr. & vb. n.', 'of Chap'),
(13084, 'Chapbook', 'n.', 'Any small book carried about for sale by chapmen or\n   hawkers. Hence, any small book; a toy book.'),
(13085, 'Chape', 'n.', 'The piece by which an object is attached to something, as\n   the frog of a scabbard or the metal loop at the back of a buckle by\n   which it is fastened to a strap.'),
(13086, 'Chape', 'n.', 'The transverse guard of a sword or dagger.'),
(13087, 'Chape', 'n.', 'The metal plate or tip which protects the end of a scabbard,\n   belt, etc.'),
(13088, 'Chapeux', 'pl. ', 'of Chapeau'),
(13089, 'Chapeau', 'n.', 'A hat or covering for the head.'),
(13090, 'Chapeau', 'n.', 'A cap of maintenance. See Maintenance.'),
(13091, 'Chaped', 'p. p. / a.', 'Furnished with a chape or chapes.'),
(13092, 'Chapel', 'n.', 'A subordinate place of worship'),
(13093, 'Chapel', 'n.', 'a small church, often a private foundation, as for a\n   memorial'),
(13094, 'Chapel', 'n.', 'a small building attached to a church'),
(13095, 'Chapel', 'n.', 'a room or recess in a church, containing an altar.'),
(13096, 'Chapel', 'n.', 'A place of worship not connected with a church; as, the\n   chapel of a palace, hospital, or prison.'),
(13097, 'Chapel', 'n.', 'In England, a place of worship used by dissenters from the\n   Established Church; a meetinghouse.'),
(13098, 'Chapel', 'n.', 'A choir of singers, or an orchestra, attached to the court\n   of a prince or nobleman.'),
(13099, 'Chapel', 'n.', 'A printing office, said to be so called because printing\n   was first carried on in England in a chapel near Westminster Abbey.'),
(13100, 'Chapel', 'n.', 'An association of workmen in a printing office.'),
(13101, 'Chapel', 'v. t.', 'To deposit or inter in a chapel; to enshrine.'),
(13102, 'Chapel', 'v. t.', 'To cause (a ship taken aback in a light breeze) so to\n   turn or make a circuit as to recover, without bracing the yards, the\n   same tack on which she had been sailing.'),
(13103, 'Chapelet', 'n.', 'A pair of straps, with stirrups, joined at the top and\n   fastened to the pommel or the frame of the saddle, after they have been\n   adjusted to the convenience of the rider.'),
(13104, 'Chapelet', 'n.', 'A kind of chain pump, or dredging machine.'),
(13105, 'Chapelry', 'n.', 'The territorial district legally assigned to a chapel.'),
(13106, 'Chaperon', 'n.', 'A hood; especially, an ornamental or an official hood.'),
(13107, 'Chaperon', 'n.', 'A device placed on the foreheads of horses which draw the\n   hearse in pompous funerals.'),
(13108, 'Chaperon', 'n.', 'A matron who accompanies a young lady in public, for\n   propriety, or as a guide and protector.'),
(13109, 'Chaperon', 'v. t.', 'To attend in public places as a guide and protector;\n   to matronize.'),
(13110, 'Chapiter', 'n.', 'A capital [Obs.] See Chapital.'),
(13111, 'Chapiter', 'n.', 'A summary in writing of such matters as are to be\n   inquired of or presented before justices in eyre, or justices of\n   assize, or of the peace, in their sessions; -- also called articles.'),
(13112, 'Chaplain', 'n.', 'An ecclesiastic who has a chapel, or who performs\n   religious service in a chapel.'),
(13113, 'Chaplain', 'n.', 'A clergyman who is officially attached to the army or\n   navy, to some public institution, or to a family or court, for the\n   purpose of performing divine service.'),
(13114, 'Chaplain', 'n.', 'Any person (clergyman or layman) chosen to conduct\n   religious exercises for a society, etc.; as, a chaplain of a Masonic or\n   a temperance lodge.'),
(13115, 'Chapless', 'a.', 'Having no lower jaw; hence, fleshless.'),
(13116, 'Chaplet', 'n.', 'A garland or wreath to be worn on the head.'),
(13117, 'Chaplet', 'n.', 'A string of beads, or part of a string, used by Roman\n   Catholic in praying; a third of a rosary, or fifty beads.'),
(13118, 'Chaplet', 'n.', 'A small molding, carved into beads, pearls, olives, etc.'),
(13119, 'Chaplet', 'n.', 'A chapelet. See Chapelet, 1.'),
(13120, 'Chaplet', 'n.', 'A bent piece of sheet iron, or a pin with thin plates on\n   its ends, for holding a core in place in the mold.'),
(13121, 'Chaplet', 'n.', 'A tuft of feathers on a peacock\'s head.'),
(13122, 'Chaplet', 'n.', 'A small chapel or shrine.'),
(13123, 'Chaplet', 'v. t.', 'To adorn with a chaplet or with flowers.'),
(13124, 'Chapmen', 'pl. ', 'of Chapman'),
(13125, 'Chapman', 'n.', 'One who buys and sells; a merchant; a buyer or a seller.'),
(13126, 'Chapman', 'n.', 'A peddler; a hawker.'),
(13127, 'Chappy', '', 'Full of chaps; cleft; gaping; open.'),
(13128, 'Chaps', 'n. pl.', 'The jaws, or the fleshy parts about them. See Chap.'),
(13129, 'Chapter', 'n.', 'A division of a book or treatise; as, Genesis has fifty\n   chapters.'),
(13130, 'Chapter', 'n.', 'An assembly of monks, or of the prebends and other\n   clergymen connected with a cathedral, conventual, or collegiate church,\n   or of a diocese, usually presided over by the dean.'),
(13131, 'Chapter', 'n.', 'A community of canons or canonesses.'),
(13132, 'Chapter', 'n.', 'A bishop\'s council.'),
(13133, 'Chapter', 'n.', 'A business meeting of any religious community.'),
(13134, 'Chapter', 'n.', 'An organized branch of some society or fraternity as of\n   the Freemasons.'),
(13135, 'Chapter', 'n.', 'A meeting of certain organized societies or orders.'),
(13136, 'Chapter', 'n.', 'A chapter house.'),
(13137, 'Chapter', 'n.', 'A decretal epistle.'),
(13138, 'Chapter', 'n.', 'A location or compartment.'),
(13139, 'Chapter', 'v. t.', 'To divide into chapters, as a book.'),
(13140, 'Chapter', 'v. t.', 'To correct; to bring to book, i. e., to demand chapter\n   and verse.'),
(13141, 'Chaptrel', 'n.', 'An impost.'),
(13142, 'Charr', 'n.', 'One of the several species of fishes of the genus\n   Salvelinus, allied to the spotted trout and salmon, inhabiting deep\n   lakes in mountainous regions in Europe. In the United States, the brook\n   trout (Salvelinus fontinalis) is sometimes called a char.'),
(13143, 'Chare', 'v. t.', 'To perform; to do; to finish.'),
(13144, 'Chare', 'v. t.', 'To work or hew, as stone.'),
(13145, 'Chare', 'v. i.', 'To work by the day, without being a regularly hired\n   servant; to do small jobs.'),
(13146, 'Charred', 'imp. & p. p.', 'of Char'),
(13147, 'Charring', 'p. pr. & vb. n.', 'of Char'),
(13148, 'Chara', 'n.', 'A genus of flowerless plants, having articulated stems and\n   whorled branches. They flourish in wet places.'),
(13149, 'Charact', 'n.', 'A distinctive mark; a character; a letter or sign. [Obs.]\n   See Character.'),
(13150, 'Charade', 'n.', 'A verbal or acted enigma based upon a word which has two\n   or more significant syllables or parts, each of which, as well as the\n   word itself, is to be guessed from the descriptions or representations.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(13151, 'Charbon', 'n.', 'A small black spot or mark remaining in the cavity of the\n   corner tooth of a horse after the large spot or mark has become\n   obliterated.'),
(13152, 'Charbon', 'n.', 'A very contagious and fatal disease of sheep, horses, and\n   cattle. See Maligmant pustule.'),
(13153, 'Charcoal', 'v. t.', 'Impure carbon prepared from vegetable or animal\n   substances; esp., coal made by charring wood in a kiln, retort, etc.,\n   from which air is excluded. It is used for fuel and in various\n   mechanical, artistic, and chemical processes.'),
(13154, 'Charcoal', 'v. t.', 'Finely prepared charcoal in small sticks, used as a\n   drawing implement.'),
(13155, 'Chard', 'n.', 'The tender leaves or leafstalks of the artichoke, white\n   beet, etc., blanched for table use.'),
(13156, 'Chard', 'n.', 'A variety of the white beet, which produces large, succulent\n   leaves and leafstalks.'),
(13157, 'Chare', 'n.', 'A narrow street.'),
(13158, 'Chare', 'n. & v.', 'A chore; to chore; to do. See Char.'),
(13159, 'Charged', 'imp. & p. p.', 'of Charge'),
(13160, 'Charging', 'p. pr. & vb. n.', 'of Charge'),
(13161, 'Charge', 'v. t.', 'To lay on or impose, as a load, tax, or burden; to load;\n   to fill.'),
(13162, 'Charge', 'v. t.', 'To lay on or impose, as a task, duty, or trust; to\n   command, instruct, or exhort with authority; to enjoin; to urge\n   earnestly; as, to charge a jury; to charge the clergy of a diocese; to\n   charge an agent.'),
(13163, 'Charge', 'v. t.', 'To lay on, impose, or make subject to or liable for.'),
(13164, 'Charge', 'v. t.', 'To fix or demand as a price; as, he charges two dollars\n   a barrel for apples.'),
(13165, 'Charge', 'v. t.', 'To place something to the account of as a debt; to\n   debit, as, to charge one with goods. Also, to enter upon the debit side\n   of an account; as, to charge a sum to one.'),
(13166, 'Charge', 'v. t.', 'To impute or ascribe; to lay to one\'s charge.'),
(13167, 'Charge', 'v. t.', 'To accuse; to make a charge or assertion against (a\n   person or thing); to lay the responsibility (for something said or\n   done) at the door of.'),
(13168, 'Charge', 'v. t.', 'To place within or upon any firearm, piece of apparatus\n   or machinery, the quantity it is intended and fitted to hold or bear;\n   to load; to fill; as, to charge a gun; to charge an electrical machine,\n   etc.'),
(13169, 'Charge', 'v. t.', 'To ornament with or cause to bear; as, to charge an\n   architectural member with a molding.'),
(13170, 'Charge', 'v. t.', 'To assume as a bearing; as, he charges three roses or;\n   to add to or represent on; as, he charges his shield with three roses\n   or.'),
(13171, 'Charge', 'v. t.', 'To call to account; to challenge.'),
(13172, 'Charge', 'v. t.', 'To bear down upon; to rush upon; to attack.'),
(13173, 'Charge', 'v. i.', 'To make an onset or rush; as, to charge with fixed\n   bayonets.'),
(13174, 'Charge', 'v. i.', 'To demand a price; as, to charge high for goods.'),
(13175, 'Charge', 'v. i.', 'To debit on an account; as, to charge for purchases.'),
(13176, 'Charge', 'v. i.', 'To squat on its belly and be still; -- a command given\n   by a sportsman to a dog.'),
(13177, 'Charge', 'v. t.', 'A load or burder laid upon a person or thing.'),
(13178, 'Charge', 'v. t.', 'A person or thing commited or intrusted to the care,\n   custody, or management of another; a trust.'),
(13179, 'Charge', 'v. t.', 'Custody or care of any person, thing, or place; office;\n   responsibility; oversight; obigation; duty.'),
(13180, 'Charge', 'v. t.', 'Heed; care; anxiety; trouble.'),
(13181, 'Charge', 'v. t.', 'Harm.'),
(13182, 'Charge', 'v. t.', 'An order; a mandate or command; an injunction.'),
(13183, 'Charge', 'v. t.', 'An address (esp. an earnest or impressive address)\n   containing instruction or exhortation; as, the charge of a judge to a\n   jury; the charge of a bishop to his clergy.'),
(13184, 'Charge', 'v. t.', 'An accusation of a wrong of offense; allegation;\n   indictment; specification of something alleged.'),
(13185, 'Charge', 'v. t.', 'Whatever constitutes a burden on property, as rents,\n   taxes, lines, etc.; costs; expense incurred; -- usually in the plural.'),
(13186, 'Charge', 'v. t.', 'The price demanded for a thing or service.'),
(13187, 'Charge', 'v. t.', 'An entry or a account of that which is due from one\n   party to another; that which is debited in a business transaction; as,\n   a charge in an account book.'),
(13188, 'Charge', 'v. t.', 'That quantity, as of ammunition, electricity, ore, fuel,\n   etc., which any apparatus, as a gun, battery, furnace, machine, etc.,\n   is intended to receive and fitted to hold, or which is actually in it\n   at one time'),
(13189, 'Charge', 'v. t.', 'The act of rushing upon, or towards, an enemy; a sudden\n   onset or attack, as of troops, esp. cavalry; hence, the signal for\n   attack; as, to sound the charge.'),
(13190, 'Charge', 'v. t.', 'A position (of a weapon) fitted for attack; as, to bring\n   a weapon to the charge.'),
(13191, 'Charge', 'v. t.', 'A soft of plaster or ointment.'),
(13192, 'Charge', 'v. t.', 'A bearing. See Bearing, n., 8.'),
(13193, 'Charge', 'n.', 'Thirty-six pigs of lead, each pig weighing about seventy\n   pounds; -- called also charre.'),
(13194, 'Charge', 'n.', 'Weight; import; value.'),
(13195, 'Charger', 'n.', 'One who, or that which charges.'),
(13196, 'Charger', 'n.', 'An instrument for measuring or inserting a charge.'),
(13197, 'Charger', 'n.', 'A large dish.'),
(13198, 'Charger', 'n.', 'A horse for battle or parade.'),
(13199, 'Charily', 'adv.', 'In a chary manner; carefully; cautiously; frugally.'),
(13200, 'Chariot', 'n.', 'A two-wheeled car or vehicle for war, racing, state\n   processions, etc.'),
(13201, 'Chariot', 'n.', 'A four-wheeled pleasure or state carriage, having one\n   seat.'),
(13202, 'Chariot', 'v. t.', 'To convey in a chariot.'),
(13203, 'Charism', 'n.', 'A miraculously given power, as of healing, speaking\n   foreign languages without instruction, etc., attributed to some of the\n   early Christians.'),
(13204, 'Charity', 'n.', 'Love; universal benevolence; good will.'),
(13205, 'Charity', 'n.', 'Liberality in judging of men and their actions; a\n   disposition which inclines men to put the best construction on the\n   words and actions of others.'),
(13206, 'Charity', 'n.', 'Liberality to the poor and the suffering, to benevolent\n   institutions, or to worthy causes; generosity.'),
(13207, 'Charity', 'n.', 'Whatever is bestowed gratuitously on the needy or\n   suffering for their relief; alms; any act of kindness.'),
(13208, 'Charity', 'n.', 'A charitable institution, or a gift to create and support\n   such an institution; as, Lady Margaret\'s charity.'),
(13209, 'Charity', 'n.', 'Eleemosynary appointments [grants or devises] including\n   relief of the poor or friendless, education, religious culture, and\n   public institutions.'),
(13210, 'Chark', 'n.', 'Charcoal; a cinder.'),
(13211, 'Charked', 'imp. & p. p.', 'of Chark'),
(13212, 'Chark', 'v. t.', 'To burn to a coal; to char.'),
(13213, 'Charlock', 'n.', 'A cruciferous plant (Brassica sinapistrum) with yellow\n   flowers; wild mustard. It is troublesome in grain fields. Called also\n   chardock, chardlock, chedlock, and kedlock.'),
(13214, 'Charm', 'n.', 'A melody; a song.'),
(13215, 'Charm', 'n.', 'A word or combination of words sung or spoken in the\n   practice of magic; a magical combination of words, characters, etc.; an\n   incantation.'),
(13216, 'Charm', 'n.', 'That which exerts an irresistible power to please and\n   attract; that which fascinates; any alluring quality.'),
(13217, 'Charm', 'n.', 'Anything worn for its supposed efficacy to the wearer in\n   averting ill or securing good fortune.'),
(13218, 'Charm', 'n.', 'Any small decorative object worn on the person, as a seal, a\n   key, a silver whistle, or the like. Bunches of charms are often worn at\n   the watch chain.'),
(13219, 'Charmed', 'imp. & p. p.', 'of Charm'),
(13220, 'Charming', 'p. pr. & vb. n.', 'of Charm'),
(13221, 'Charm', 'n.', 'To make music upon; to tune.'),
(13222, 'Charm', 'n.', 'To subdue, control, or summon by incantation or supernatural\n   influence; to affect by magic.'),
(13223, 'Charm', 'n.', 'To subdue or overcome by some secret power, or by that which\n   gives pleasure; to allay; to soothe.'),
(13224, 'Charm', 'n.', 'To attract irresistibly; to delight exceedingly; to enchant;\n   to fascinate.'),
(13225, 'Charm', 'n.', 'To protect with, or make invulnerable by, spells, charms, or\n   supernatural influences; as, a charmed life.'),
(13226, 'Charm', 'v. i.', 'To use magic arts or occult power; to make use of charms.'),
(13227, 'Charm', 'v. i.', 'To act as, or produce the effect of, a charm; to please\n   greatly; to be fascinating.'),
(13228, 'Charm', 'v. i.', 'To make a musical sound.'),
(13229, 'Charmel', 'n.', 'A fruitful field.'),
(13230, 'Charmer', 'n.', 'One who charms, or has power to charm; one who uses the\n   power of enchantment; a magician.'),
(13231, 'Charmer', 'n.', 'One who delights and attracts the affections.'),
(13232, 'Charmful', 'a.', 'Abounding with charms.'),
(13233, 'Charming', 'a.', 'Pleasing the mind or senses in a high degree; delighting;\n   fascinating; attractive.'),
(13234, 'Charneco', 'n.', 'Alt. of Charnico'),
(13235, 'Charnico', 'n.', 'A sort of sweet wine.'),
(13236, 'Charnel', 'a.', 'Containing the bodies of the dead.'),
(13237, 'Charnel', 'n.', 'A charnel house; a grave; a cemetery.'),
(13238, 'Charon', 'n.', 'The son of Erebus and Nox, whose office it was to ferry the\n   souls of the dead over the Styx, a river of the infernal regions.'),
(13239, 'Charpie', 'n.', 'Straight threads obtained by unraveling old linen cloth;\n   -- used for surgical dressings.'),
(13240, 'Charqui', 'n.', 'Jerked beef; beef cut into long strips and dried in the\n   wind and sun.'),
(13241, 'Charr', 'n.', 'See 1st Char.'),
(13242, 'Charras', 'n.', 'The gum resin of the hemp plant (Cannabis sativa). Same as\n   Churrus.'),
(13243, 'Charre', 'n.', 'See Charge, n., 17.'),
(13244, 'Charry', 'a.', 'Pertaining to charcoal, or partaking of its qualities.'),
(13245, 'Chart', 'n.', 'A sheet of paper, pasteboard, or the like, on which\n   information is exhibited, esp. when the information is arranged in\n   tabular form; as, an historical chart.'),
(13246, 'Chart', 'n.', 'A map; esp., a hydrographic or marine map; a map on which is\n   projected a portion of water and the land which it surrounds, or by\n   which it is surrounded, intended especially for the use of seamen; as,\n   the United States Coast Survey charts; the English Admiralty charts.'),
(13247, 'Chart', 'n.', 'A written deed; a charter.'),
(13248, 'Charted', 'imp. & p. p.', 'of Chart'),
(13249, 'Chart', 'v. t.', 'To lay down in a chart; to map; to delineate; as, to\n   chart a coast.'),
(13250, 'Charta', 'n.', 'Material on which instruments, books, etc., are written;\n   parchment or paper.'),
(13251, 'Charta', 'n.', 'A charter or deed; a writing by which a grant is made. See\n   Magna Charta.'),
(13252, 'Charte', 'n.', 'The constitution, or fundamental law, of the French\n   monarchy, as established on the restoration of Louis XVIII., in 1814.'),
(13253, 'Charter', 'n.', 'A written evidence in due form of things done or granted,\n   contracts made, etc., between man and man; a deed, or conveyance.'),
(13254, 'Charter', 'n.', 'An instrument in writing, from the sovereign power of a\n   state or country, executed in due form, bestowing rights, franchises,\n   or privileges.'),
(13255, 'Charter', 'n.', 'An act of a legislative body creating a municipal or other\n   corporation and defining its powers and privileges. Also, an instrument\n   in writing from the constituted authorities of an order or society (as\n   the Freemasons), creating a lodge and defining its powers.'),
(13256, 'Charter', 'n.', 'A special privilege, immunity, or exemption.'),
(13257, 'Charter', 'n.', 'The letting or hiring a vessel by special contract, or the\n   contract or instrument whereby a vessel is hired or let; as, a ship is\n   offered for sale or charter. See Charter party, below.'),
(13258, 'Charter', 'v. t.', 'To establish by charter.'),
(13259, 'Charter', 'v. t.', 'To hire or let by charter, as a ship. See Charter\n   party, under Charter, n.'),
(13260, 'Chartism', 'n.', 'The principles of a political party in England (1838-48),\n   which contended for universal suffrage, the vote by ballot, annual\n   parliaments, equal electoral districts, and other radical reforms, as\n   set forth in a document called the People\'s Charter.'),
(13261, 'Chartist', 'n.', 'A supporter or partisan of chartism.'),
(13262, 'Chary', 'a.', 'Careful; wary; cautious; not rash, reckless, or spendthrift;\n   saving; frugal.'),
(13263, 'Chasable', 'a.', 'Capable of being chased; fit for hunting.'),
(13264, 'Chased', 'imp. & p. p.', 'of Chase'),
(13265, 'Chasing', 'p. pr. & vb. n.', 'of Chase'),
(13266, 'Chase', 'v. t.', 'To pursue for the purpose of killing or taking, as an\n   enemy, or game; to hunt.'),
(13267, 'Chase', 'v. t.', 'To follow as if to catch; to pursue; to compel to move\n   on; to drive by following; to cause to fly; -- often with away or off;\n   as, to chase the hens away.'),
(13268, 'Chase', 'v. t.', 'To pursue eagerly, as hunters pursue game.'),
(13269, 'Chase', 'v. i.', 'To give chase; to hunt; as, to chase around after a\n   doctor.'),
(13270, 'Chase', 'v.', 'Vehement pursuit for the purpose of killing or capturing, as\n   of an enemy, or game; an earnest seeking after any object greatly\n   desired; the act or habit of hunting; a hunt.'),
(13271, 'Chase', 'v.', 'That which is pursued or hunted.'),
(13272, 'Chase', 'v.', 'An open hunting ground to which game resorts, and which is\n   private properly, thus differing from a forest, which is not private\n   property, and from a park, which is inclosed. Sometimes written chace.'),
(13273, 'Chase', 'v.', 'A division of the floor of a gallery, marked by a figure or\n   otherwise; the spot where a ball falls, and between which and the\n   dedans the adversary must drive his ball in order to gain a point.'),
(13274, 'Chase', 'n.', 'A rectangular iron frame in which pages or columns of type\n   are imposed.'),
(13275, 'Chase', 'n.', 'The part of a cannon from the reenforce or the trunnions to\n   the swell of the muzzle. See Cannon.'),
(13276, 'Chase', 'n.', 'A groove, or channel, as in the face of a wall; a trench, as\n   for the reception of drain tile.'),
(13277, 'Chase', 'n.', 'A kind of joint by which an overlap joint is changed to a\n   flush joint, by means of a gradually deepening rabbet, as at the ends\n   of clinker-built boats.'),
(13278, 'Chase', 'v. t.', 'To ornament (a surface of metal) by embossing, cutting\n   away parts, and the like.'),
(13279, 'Chase', 'v. t.', 'To cut, so as to make a screw thread.'),
(13280, 'Chaser', 'n.', 'One who or that which chases; a pursuer; a driver; a\n   hunter.'),
(13281, 'Chaser', 'n.', 'Same as Chase gun, esp. in terms bow chaser and stern\n   chaser. See under Bow, Stern.'),
(13282, 'Chaser', 'n.', 'One who chases or engraves. See 5th Chase, and Enchase.'),
(13283, 'Chaser', 'n.', 'A tool with several points, used for cutting or finishing\n   screw threads, either external or internal, on work revolving in a\n   lathe.'),
(13284, 'Chasible', 'n.', 'See Chasuble.'),
(13285, 'Chasing', 'n.', 'The art of ornamenting metal by means of chasing tools;\n   also, a piece of ornamental work produced in this way.'),
(13286, 'Chasm', 'n.', 'A deep opening made by disruption, as a breach in the earth\n   or a rock; a yawning abyss; a cleft; a fissure.'),
(13287, 'Chasm', 'n.', 'A void space; a gap or break, as in ranks of men.'),
(13288, 'Chasmed', 'a.', 'Having gaps or a chasm.'),
(13289, 'Chasmy', 'a.', 'Of or pertaining to a chasm; abounding in chasms.'),
(13290, 'Chasse', 'n.', 'A movement in dancing, as across or to the right or left.'),
(13291, 'Chasse', 'v. i.', 'To make the movement called chasse; as, all chasse;\n   chasse to the right or left.'),
(13292, 'Chasseur', 'n.', 'One of a body of light troops, cavalry or infantry,\n   trained for rapid movements.'),
(13293, 'Chasseur', 'n.', 'An attendant upon persons of rank or wealth, wearing a\n   plume and sword.'),
(13294, 'Chassis', 'n.', 'A traversing base frame, or movable railway, along which\n   the carriage of a barbette or casemate gun moves backward and forward.\n   [See Gun carriage.]'),
(13295, 'Chast', 'v. t.', 'to chasten.'),
(13296, 'Chaste', 'a.', 'Pure from unlawful sexual intercourse; virtuous; continent.'),
(13297, 'Chaste', 'a.', 'Pure in thought and act; innocent; free from lewdness and\n   obscenity, or indecency in act or speech; modest; as, a chaste mind;\n   chaste eyes.'),
(13298, 'Chaste', 'a.', 'Pure in design and expression; correct; free from\n   barbarisms or vulgarisms; refined; simple; as, a chaste style in\n   composition or art.'),
(13299, 'Chaste', 'a.', 'Unmarried.'),
(13300, 'Chastely', 'adv.', 'In a chaste manner; with purity.'),
(13301, 'Chasten', 'v. t.', 'To correct by punishment; to inflict pain upon the\n   purpose of reclaiming; to discipline; as, to chasten a son with a rod.'),
(13302, 'Chasten', 'v. t.', 'To purify from errors or faults; to refine.'),
(13303, 'Chastise', 'v. t.', 'To inflict pain upon, by means of stripes, or in any\n   other manner, for the purpose of punishment or reformation; to punish,\n   as with stripes.'),
(13304, 'Chastise', 'v. t.', 'To reduce to order or obedience; to correct or purify;\n   to free from faults or excesses.'),
(13305, 'Chastity', 'n.', 'The state of being chaste; purity of body; freedom from\n   unlawful sexual intercourse.'),
(13306, 'Chastity', 'n.', 'Moral purity.'),
(13307, 'Chastity', 'n.', 'The unmarried life; celibacy.'),
(13308, 'Chastity', 'n.', 'Chasteness.'),
(13309, 'Chasuble', 'n.', 'The outer vestment worn by the priest in saying Mass,\n   consisting, in the Roman Catholic Church, of a broad, flat, back piece,\n   and a narrower front piece, the two connected over the shoulders only.\n   The back has usually a large cross, the front an upright bar or pillar,\n   designed to be emblematical of Christ\'s sufferings. In the Greek Church\n   the chasuble is a large round mantle.'),
(13310, 'Chatted', 'imp. & p. p.', 'of Chat'),
(13311, 'Chatting', 'p. pr. & vb. n.', 'of Chat'),
(13312, 'Chateux', 'pl. ', 'of Chateau'),
(13313, 'Chateau', 'n.', 'A castle or a fortress in France.'),
(13314, 'Chateau', 'n.', 'A manor house or residence of the lord of the manor; a\n   gentleman\'s country seat; also, particularly, a royal residence; as,\n   the chateau of the Louvre; the chateau of the Luxembourg.'),
(13315, 'Chatelet', 'n.', 'A little castle.'),
(13316, 'Chati', 'n.', 'A small South American species of tiger cat (Felis mitis).'),
(13317, 'Chattel', 'n.', 'Any item of movable or immovable property except the\n   freehold, or the things which are parcel of it. It is a more extensive\n   term than goods or effects.'),
(13318, 'Chatter', 'v. i.', 'To utter sounds which somewhat resemble language, but\n   are inarticulate and indistinct.'),
(13319, 'Chatter', 'v. i.', 'To talk idly, carelessly, or with undue rapidity; to\n   jabber; to prate.'),
(13320, 'Chatter', 'v. i.', 'To make a noise by rapid collisions.'),
(13321, 'Chatter', 'v. t.', 'To utter rapidly, idly, or indistinctly.'),
(13322, 'Chatter', 'n.', 'Sounds like those of a magpie or monkey; idle talk; rapid,\n   thoughtless talk; jabber; prattle.'),
(13323, 'Chatter', 'n.', 'Noise made by collision of the teeth, as in shivering.'),
(13324, 'Chatty', 'a.', 'Given to light, familiar talk; talkative.'),
(13325, 'Chatty', 'n.', 'A porous earthen pot used in India for cooling water, etc.'),
(13326, 'Chatwood', 'n.', 'Little sticks; twigs for burning; fuel.'),
(13327, 'Chaudron', 'n.', 'See Chawdron.'),
(13328, 'Chauffer', 'n.', 'A table stove or small furnace, usually a cylindrical box\n   of sheet iron, with a grate at the bottom, and an open top.'),
(13329, 'Chaun', 'n.', 'A gap.'),
(13330, 'Chaun', 'v. t. & i.', 'To open; to yawn.'),
(13331, 'Chaunt', 'n. & v.', 'See Chant.'),
(13332, 'Chaunter', 'n.', 'A street seller of ballads and other broadsides.'),
(13333, 'Chaunter', 'n.', 'A deceitful, tricky dealer or horse jockey.'),
(13334, 'Chaunter', 'n.', 'The flute of a bagpipe. See Chanter, n., 3.'),
(13335, 'Chaus', 'n.', 'a lynxlike animal of Asia and Africa (Lynx Lybicus).'),
(13336, 'Chausses', 'n. pl.', 'The garment for the legs and feet and for the body\n   below the waist, worn in Europe throughout the Middle Ages; applied\n   also to the armor for the same parts, when fixible, as of chain mail.'),
(13337, 'Chawed', 'imp. & p. p.', 'of Chaw'),
(13338, 'Chawing', 'p. pr. & vb. n.', 'of Chaw'),
(13339, 'Chawdron', 'n.', 'Entrails.'),
(13340, 'Cheap', 'n.', 'A bargain; a purchase; cheapness.'),
(13341, 'Cheap', 'n.', 'Having a low price in market; of small cost or price, as\n   compared with the usual price or the real value.'),
(13342, 'Cheap', 'n.', 'Of comparatively small value; common; mean.'),
(13343, 'Cheap', 'adv.', 'Cheaply.'),
(13344, 'Cheap', 'v. i.', 'To buy; to bargain.'),
(13345, 'Cheapen', 'v. t.', 'To ask the price of; to bid, bargain, or chaffer for.'),
(13346, 'Cheapen', 'a.', 'To beat down the price of; to lessen the value of; to\n   depreciate.'),
(13347, 'Cheaply', 'adv.', 'At a small price; at a low value; in a common or\n   inferior manner.'),
(13348, 'Chear', 'n. & v.', 'See Cheer.'),
(13349, 'Cheat', 'n.', 'An act of deception or fraud; that which is the means of\n   fraud or deception; a fraud; a trick; imposition; imposture.'),
(13350, 'Cheat', 'n.', 'One who cheats or deceives; an impostor; a deceiver; a\n   cheater.'),
(13351, 'Cheat', 'n.', 'A troublesome grass, growing as a weed in grain fields; --\n   called also chess. See Chess.'),
(13352, 'Cheat', 'n.', 'The obtaining of property from another by an intentional\n   active distortion of the truth.'),
(13353, 'Cheated', 'imp. & p. p.', 'of Cheat'),
(13354, 'Cheating', 'p. pr. & vb. n.', 'of Cheat'),
(13355, 'Cheat', 'n.', 'To deceive and defraud; to impose upon; to trick; to\n   swindle.'),
(13356, 'Cheat', 'n.', 'To beguile.'),
(13357, 'Cheat', 'v. i.', 'To practice fraud or trickery; as, to cheat at cards.'),
(13358, 'Cheat', 'n.', 'Wheat, or bread made from wheat.'),
(13359, 'Cheater', 'n.', 'One who cheats.'),
(13360, 'Cheater', 'n.', 'An escheator.'),
(13361, 'Chebacco', 'n.', 'A narrow-sterned boat formerly much used in the\n   Newfoundland fisheries; -- called also pinkstern and chebec.'),
(13362, 'Chebec', 'n.', 'See Chebacco.'),
(13363, 'Chebec', 'n.', 'A small American bird (Empidonax minimus); the least\n   flycatcher.'),
(13364, 'Check', 'n.', 'A word of warning denoting that the king is in danger; such\n   a menace of a player\'s king by an adversary\'s move as would, if it were\n   any other piece, expose it to immediate capture. A king so menaced is\n   said to be in check, and must be made safe at the next move.'),
(13365, 'Check', 'n.', 'A condition of interrupted or impeded progress; arrest;\n   stop; delay; as, to hold an enemy in check.'),
(13366, 'Check', 'n.', 'Whatever arrests progress, or limits action; an obstacle,\n   guard, restraint, or rebuff.'),
(13367, 'Check', 'n.', 'A mark, certificate, or token, by which, errors may be\n   prevented, or a thing or person may be identified; as, checks placed\n   against items in an account; a check given for baggage; a return check\n   on a railroad.'),
(13368, 'Check', 'n.', 'A written order directing a bank or banker to pay money as\n   therein stated. See Bank check, below.'),
(13369, 'Check', 'n.', 'A woven or painted design in squares resembling the patten\n   of a checkerboard; one of the squares of such a design; also, cloth\n   having such a figure.'),
(13370, 'Check', 'n.', 'The forsaking by a hawk of its proper game to follow other\n   birds.'),
(13371, 'Check', 'n.', 'Small chick or crack.'),
(13372, 'Checked', 'imp. & p. p.', 'of Check'),
(13373, 'Checking', 'p. pr. & vb. n.', 'of Check'),
(13374, 'Check', 'v. t.', 'To make a move which puts an adversary\'s piece, esp. his\n   king, in check; to put in check.'),
(13375, 'Check', 'v. t.', 'To put a sudden restraint upon; to stop temporarily; to\n   hinder; to repress; to curb.'),
(13376, 'Check', 'v. t.', 'To verify, to guard, to make secure, by means of a mark,\n   token, or other check; to distinguish by a check; to put a mark against\n   (an item) after comparing with an original or a counterpart in order to\n   secure accuracy; as, to check an account; to check baggage.'),
(13377, 'Check', 'v. t.', 'To chide, rebuke, or reprove.'),
(13378, 'Check', 'v. t.', 'To slack or ease off, as a brace which is too stiffly\n   extended.'),
(13379, 'Check', 'v. t.', 'To make checks or chinks in; to cause to crack; as, the\n   sun checks timber.'),
(13380, 'Check', 'v. i.', 'To make a stop; to pause; -- with at.'),
(13381, 'Check', 'v. i.', 'To clash or interfere.'),
(13382, 'Check', 'v. i.', 'To act as a curb or restraint.'),
(13383, 'Check', 'v. i.', 'To crack or gape open, as wood in drying; or to crack in\n   small checks, as varnish, paint, etc.'),
(13384, 'Check', 'v. i.', 'To turn, when in pursuit of proper game, and fly after\n   other birds.'),
(13385, 'Check', 'a.', 'Checkered; designed in checks.'),
(13386, 'Checkage', 'n.', 'The act of checking; as, the checkage of a name or of an\n   item in a list.'),
(13387, 'Checkage', 'n.', 'The items, or the amount, to which attention is called by\n   a check or checks.'),
(13388, 'Checker', 'v. t.', 'One who checks.'),
(13389, 'Checker', 'n.', 'To mark with small squares like a checkerboard, as by\n   crossing stripes of different colors.'),
(13390, 'Checker', 'n.', 'To variegate or diversify with different qualities,\n   colors, scenes, or events; esp., to subject to frequent alternations of\n   prosperity and adversity.'),
(13391, 'Checker', 'v. t.', 'A piece in the game of draughts or checkers.'),
(13392, 'Checker', 'v. t.', 'A pattern in checks; a single check.'),
(13393, 'Checker', 'v. t.', 'Checkerwork.'),
(13394, 'Checkers', 'v.', 'A game, called also daughts, played on a checkerboard by\n   two persons, each having twelve men (counters or checkers) which are\n   moved diagonally. The game is ended when either of the players has lost\n   all his men, or can not move them.'),
(13395, 'Checky', 'a.', 'Divided into small alternating squares of two tinctures; --\n   said of the field or of an armorial bearing.'),
(13396, 'Cheddar', 'a.', 'Of or pertaining to, or made at, Cheddar, in England; as,\n   Cheddar cheese.'),
(13397, 'Cheek', 'n.', 'The side of the face below the eye.'),
(13398, 'Cheek', 'n.', 'The cheek bone.'),
(13399, 'Cheek', 'n.', 'Those pieces of a machine, or of any timber, or stone work,\n   which form corresponding sides, or which are similar and in pair; as,\n   the cheeks (jaws) of a vise; the cheeks of a gun carriage, etc.'),
(13400, 'Cheek', 'n.', 'The branches of a bridle bit.'),
(13401, 'Cheek', 'n.', 'A section of a flask, so made that it can be moved\n   laterally, to permit the removal of the pattern from the mold; the\n   middle part of a flask.'),
(13402, 'Cheek', 'n.', 'Cool confidence; assurance; impudence.'),
