(13404, 'Cheeked', 'a.', 'Having a cheek; -- used in composition.'),
(13405, 'Cheeky', '', 'a Brazen-faced; impudent; bold.'),
(13406, 'Cheeped', 'imp. & p. p.', 'of Cheep'),
(13407, 'Cheep', 'v. i.', 'To chirp, as a young bird.'),
(13408, 'Cheep', 'v. t.', 'To give expression to in a chirping tone.'),
(13409, 'Cheep', 'n.', 'A chirp, peep, or squeak, as of a young bird or mouse.'),
(13410, 'Cheer', 'n.', 'The face; the countenance or its expression.'),
(13411, 'Cheer', 'n.', 'Feeling; spirit; state of mind or heart.'),
(13412, 'Cheer', 'n.', 'Gayety; mirth; cheerfulness; animation.'),
(13413, 'Cheer', 'n.', 'That which promotes good spirits or cheerfulness; provisions\n   prepared for a feast; entertainment; as, a table loaded with good\n   cheer.'),
(13414, 'Cheer', 'n.', 'A shout, hurrah, or acclamation, expressing joy enthusiasm,\n   applause, favor, etc.'),
(13415, 'Cheered', 'imp. & p. p.', 'of Cheer'),
(13416, 'Cheering', 'p. pr. & vb. n.', 'of Cheer'),
(13417, 'Cheer', 'v. t.', 'To cause to rejoice; to gladden; to make cheerful; --\n   often with up.'),
(13418, 'Cheer', 'v. t.', 'To infuse life, courage, animation, or hope, into; to\n   inspirit; to solace or comfort.'),
(13419, 'Cheer', 'v. t.', 'To salute or applaud with cheers; to urge on by cheers;\n   as, to cheer hounds in a chase.'),
(13420, 'Cheer', 'v. i.', 'To grow cheerful; to become gladsome or joyous; --\n   usually with up.'),
(13421, 'Cheer', 'v. i.', 'To be in any state or temper of mind.'),
(13422, 'Cheer', 'v. i.', 'To utter a shout or shouts of applause, triumph, etc.'),
(13423, 'Cheerer', 'n.', 'One who cheers; one who, or that which, gladdens.'),
(13424, 'Cheerful', 'a.', 'Having or showing good spirits or joy; cheering; cheery;\n   contented; happy; joyful; lively; animated; willing.'),
(13425, 'Cheerily', 'adv.', 'In a cheery manner.'),
(13426, 'Cheerly', 'a.', 'Gay; cheerful.'),
(13427, 'Cheerly', 'adv.', 'Cheerily.'),
(13428, 'Cheerry', 'a.', 'Cheerful; lively; gay; bright; pleasant; as, a cheery\n   person.'),
(13429, 'Cheese', 'n.', 'The curd of milk, coagulated usually with rennet, separated\n   from the whey, and pressed into a solid mass in a hoop or mold.'),
(13430, 'Cheese', 'n.', 'A mass of pomace, or ground apples, pressed together in the\n   form of a cheese.'),
(13431, 'Cheese', 'n.', 'The flat, circular, mucilaginous fruit of the dwarf mallow\n   (Malva rotundifolia).'),
(13432, 'Cheese', 'n.', 'A low courtesy; -- so called on account of the cheese form\n   assumed by a woman\'s dress when she stoops after extending the skirts\n   by a rapid gyration.'),
(13433, 'Cheesy', 'a.', 'Having the nature, qualities, taste, form, consistency, or\n   appearance of cheese.'),
(13434, 'Cheetah', 'n.', 'A species of leopard (Cynaelurus jubatus) tamed and used\n   for hunting in India. The woolly cheetah of South Africa is C. laneus.'),
(13435, 'Chegoe', 'n.', 'Alt. of Chegre'),
(13436, 'Chegre', 'n.', 'See Chigoe.'),
(13437, 'Chekmak', 'n.', 'A turkish fabric of silk and cotton, with gold thread\n   interwoven.'),
(13438, 'Chelae', 'pl. ', 'of Chela'),
(13439, 'Chela', 'n.', 'The pincherlike claw of Crustacea and Arachnida.'),
(13440, 'Chelate', 'a.', 'Same as Cheliferous.'),
(13441, 'Chelidon', 'n.', 'The hollow at the flexure of the arm.'),
(13442, 'Chelifer', 'n.', 'See Book scorpion, under Book.'),
(13443, 'Chelone', 'n.', 'A genus of hardy perennial flowering plants, of the order\n   Scrophulariaceae, natives of North America; -- called also snakehead,\n   turtlehead, shellflower, etc.'),
(13444, 'Chelonia', 'n. pl.', 'An order of reptiles, including the tortoises and\n   turtles, peculiar in having a part of the vertebrae, ribs, and sternum\n   united with the dermal plates so as to form a firm shell. The jaws are\n   covered by a horny beak. See Reptilia; also, Illust. in Appendix.'),
(13445, 'Chelura', 'n.', 'A genus of marine amphipod crustacea, which bore into and\n   sometimes destroy timber.'),
(13446, 'Chely', 'n.', 'A claw. See Chela.'),
(13447, 'Chemic', 'n.', 'A chemist; an alchemist.'),
(13448, 'Chemic', 'n.', 'A solution of chloride of lime.'),
(13449, 'Chemic', 'a.', 'Chemical.'),
(13450, 'Chemical', 'a.', 'Pertaining to chemistry; characterized or produced by the\n   forces and operations of chemistry; employed in the processes of\n   chemistry; as, chemical changes; chemical combinations.'),
(13451, 'Chemical', 'n.', 'A substance used for producing a chemical effect; a\n   reagent.'),
(13452, 'Chemise', 'n.', 'A shift, or undergarment, worn by women.'),
(13453, 'Chemise', 'n.', 'A wall that lines the face of a bank or earthwork.'),
