(13458, 'Chepster', 'n.', 'The European starling.'),
(13459, 'Cheque', 'n.', 'See Check.'),
(13460, 'Chequer', 'n. & v.', 'Same as Checker.'),
(13461, 'Chequing', 'n.', 'A coin. See Sequin.'),
(13462, 'Chequy', 'n.', 'Same as Checky.'),
(13463, 'Cherif', 'n.', 'See Cherif.'),
(13464, 'Cherish', 'v. t.', 'To treat with tenderness and affection; to nurture with\n   care; to protect and aid.'),
