(13467, 'Cheroot', 'n.', 'A kind of cigar, originally brought from Mania, in the\n   Philippine Islands; now often made of inferior or adulterated tobacco.'),
(13468, 'Cherry', 'n.', 'A tree or shrub of the genus Prunus (Which also includes\n   the plum) bearing a fleshy drupe with a bony stone;'),
(13469, 'Cherry', 'n.', 'The common garden cherry (Prunus Cerasus), of which several\n   hundred varieties are cultivated for the fruit, some of which are, the\n   begarreau, blackheart, black Tartarian, oxheart, morelle or morello,\n   May-duke (corrupted from Medoc in France).'),
(13470, 'Cherry', 'n.', 'The wild cherry; as, Prunus serotina (wild black cherry),\n   valued for its timber; P. Virginiana (choke cherry), an American shrub\n   which bears astringent fruit; P. avium and P. Padus, European trees\n   (bird cherry).'),
(13471, 'Cherry', 'n.', 'The fruit of the cherry tree, a drupe of various colors and\n   flavors.'),
(13472, 'Cherry', 'n.', 'The timber of the cherry tree, esp. of the black cherry,\n   used in cabinetmaking, etc.'),
(13473, 'Cherry', 'n.', 'A peculiar shade of red, like that of a cherry.'),
(13474, 'Cherry', 'a.', 'Like a red cherry in color; ruddy; blooming; as, a cherry\n   lip; cherry cheeks.'),
(13475, 'Chert', 'n.', 'An impure, massive, flintlike quartz or hornstone, of a dull\n   color.'),
(13476, 'Cherty', 'a.', 'Like chert; containing chert; flinty.'),
(13477, 'Cherubs', 'pl. ', 'of Cherub'),
(13478, 'Cherubim', 'pl. ', 'of Cherub'),
(13479, 'Cherub', 'n.', 'A mysterious composite being, the winged footstool and\n   chariot of the Almighty, described in Ezekiel i. and x.'),
(13480, 'Cherub', 'n.', 'A symbolical winged figure of unknown form used in\n   connection with the mercy seat of the Jewish Ark and Temple.'),
(13481, 'Cherub', 'n.', 'One of a order of angels, variously represented in art. In\n   European painting the cherubim have been shown as blue, to denote\n   knowledge, as distinguished from the seraphim (see Seraph), and in\n   later art the children\'s heads with wings are generally called cherubs.'),
(13482, 'Cherub', 'n.', 'A beautiful child; -- so called because artists have\n   represented cherubs as beautiful children.'),
(13483, 'Cherubic', 'a.', 'Alt. of Cherubical'),
(13484, 'Cherubim', 'n.', 'The Hebrew plural of Cherub.. Cf. Seraphim.'),
(13485, 'Cherubin', 'a.', 'Cherubic; angelic.'),
(13486, 'Cherubin', 'n.', 'A cherub.'),
(13487, 'Cherup', 'v. i.', 'To make a short, shrill, cheerful sound; to chirp. See\n   Chirrup.'),
(13488, 'Cherup', 'v. t.', 'To excite or urge on by making a short, shrill, cheerful\n   sound; to cherup to. See Chirrup.'),
(13489, 'Cherup', 'n.', 'A short, sharp, cheerful noise; a chirp; a chirrup; as, the\n   cherup of a cricket.'),
(13490, 'Chervil', 'n.', 'A plant (Anthriscus cerefolium) with pinnately divided\n   aromatic leaves, of which several curled varieties are used in soups\n   and salads.'),
(13491, 'Chese', 'v. t.', 'To choose'),
(13492, 'Chesible', 'n.', 'See Chasuble.'),
(13493, 'Cheslip', 'n.', 'The wood louse.'),
(13494, 'Chess', 'n.', 'A game played on a chessboard, by two persons, with two\n   differently colored sets of men, sixteen in each set. Each player has a\n   king, a queen, two bishops, two knights, two castles or rooks, and\n   eight pawns.'),
(13495, 'Chess', 'n.', 'A species of brome grass (Bromus secalinus) which is a\n   troublesome weed in wheat fields, and is often erroneously regarded as\n   degenerate or changed wheat; it bears a very slight resemblance to\n   oats, and if reaped and ground up with wheat, so as to be used for\n   food, is said to produce narcotic effects; -- called also cheat and\n   Willard\'s bromus.'),
(13496, 'Chessel', 'n.', 'The wooden mold in which cheese is pressed.'),
(13497, 'Chesses', 'n. pl.', 'The platforms, consisting of two or more planks\n   doweled together, for the flooring of a temporary military bridge.'),
(13498, 'Chessil', 'n.', 'Gravel or pebbles.'),
(13499, 'Chessmen', 'pl. ', 'of Chessman'),
(13500, 'Chessman', 'n.', 'A piece used in the game of chess.'),
(13501, 'Chessom', 'n.', 'Mellow earth; mold.'),
(13502, 'Chest', 'n.', 'A large box of wood, or other material, having, like a\n   trunk, a lid, but no covering of skin, leather, or cloth.'),
(13503, 'Chest', 'n.', 'A coffin.'),
(13504, 'Chest', 'n.', 'The part of the body inclosed by the ribs and breastbone;\n   the thorax.'),
(13505, 'Chest', 'n.', 'A case in which certain goods, as tea, opium, etc., are\n   transported; hence, the quantity which such a case contains.'),
(13506, 'Chest', 'n.', 'A tight receptacle or box, usually for holding gas, steam,\n   liquids, etc.; as, the steam chest of an engine; the wind chest of an\n   organ.'),
(13507, 'Chested', 'imp. & p. p.', 'of Chest'),
(13508, 'Chest', 'v. i.', 'To deposit in a chest; to hoard.'),
(13509, 'Chest', 'v. i.', 'To place in a coffin.'),
(13510, 'Chest', 'n.', 'Strife; contention; controversy.'),
(13511, 'Chested', 'a.', 'Having (such) a chest; -- in composition; as,\n   broad-chested; narrow-chested.'),
(13512, 'Chesteyn', 'n.', 'The chestnut tree.'),
(13513, 'Chestnut', 'n.', 'The edible nut of a forest tree (Castanea vesca) of\n   Europe and America. Commonly two or more of the nuts grow in a prickly\n   bur.'),
(13514, 'Chestnut', 'n.', 'The tree itself, or its light, coarse-grained timber,\n   used for ornamental work, furniture, etc.'),
(13515, 'Chestnut', 'n.', 'A bright brown color, like that of the nut.'),
(13516, 'Chestnut', 'n.', 'The horse chestnut (often so used in England).'),
(13517, 'Chestnut', 'n.', 'One of the round, or oval, horny plates on the inner\n   sides of the legs of the horse, and allied animals.'),
(13518, 'Chestnut', 'n.', 'An old joke or story.'),
(13519, 'Chestnut', 'a.', 'Of the color of a chestnut; of a reddish brown color; as,\n   chestnut curls.'),
(13520, 'Chetah', 'n.', 'See Cheetah.'),
(13521, 'Chetvert', 'n.', 'A measure of grain equal to 0.7218 of an imperial\n   quarter, or 5.95 Winchester bushels.'),
(13522, 'Chevage', 'n.', 'See Chiefage.'),
(13523, 'Chevaux', 'pl. ', 'of Cheval'),
(13524, 'Cheval', 'n.', 'A horse; hence, a support or frame.'),
(13525, 'Chevaux', 'n. pl.', 'See Cheval.'),
(13526, 'Cheve', 'v. i.', 'To come to an issue; to turn out; to succeed; as, to\n   cheve well in a enterprise.'),
(13527, 'Cheven', 'n.', 'A river fish; the chub.'),
(13528, 'Cheveril', 'v. i.', 'Soft leather made of kid skin. Fig.: Used as a symbol\n   of flexibility.'),
(13529, 'Cheveril', 'a.', 'Made of cheveril; pliant.'),
(13530, 'Chevet', 'n.', 'The extreme end of the chancel or choir; properly the round\n   or polygonal part.'),
(13531, 'Cheviot', 'n.', 'A valuable breed of mountain sheep in Scotland, which\n   takes its name from the Cheviot hills.'),
(13532, 'Cheviot', 'n.', 'A woolen fabric, for men\'s clothing.'),
(13533, 'Chevron', 'n.', 'One of the nine honorable ordinaries, consisting of two\n   broad bands of the width of the bar, issuing, respectively from the\n   dexter and sinister bases of the field and conjoined at its center.'),
(13534, 'Chevron', 'n.', 'A distinguishing mark, above the elbow, on the sleeve of a\n   non-commissioned officer\'s coat.'),
(13535, 'Chevron', 'n.', 'A zigzag molding, or group of moldings, common in Norman\n   architecture.'),
(13536, 'Chevy', 'v. t.', 'See Chivy, v. t.'),
(13537, 'Chewed', 'imp. & p. p.', 'of Chew'),
(13538, 'Chewing', 'p. pr. & vb. n.', 'of Chew'),
(13539, 'Chewer', 'n.', 'One who chews.'),
(13540, 'Chewet', 'n.', 'A kind of meat pie.'),
(13541, 'Chewink', 'n.', 'An american bird (Pipilo erythrophthalmus) of the Finch\n   family, so called from its note; -- called also towhee bunting and\n   ground robin.'),
(13542, 'Chian', 'a.', 'Of or pertaining to Chios, an island in the Aegean Sea.'),
(13543, 'Chiasm', 'n.', 'Alt. of Chiasma'),
(13544, 'Chiasma', 'n.', 'A commissure; especially, the optic commissure, or crucial\n   union of the optic nerves.'),
(13545, 'Chiasmus', 'n.', 'An inversion of the order of words or phrases, when\n   repeated or subsequently referred to in a sentence'),
(13546, 'Chibbal', 'n.', 'See Cibol.'),
(13547, 'Chibouk', 'n.', 'A Turkish pipe, usually with a mouthpiece of amber, a\n   stem, four or five feet long and not pliant, of some valuable wood, and\n   a bowl of baked clay.'),
(13548, 'Chica', 'n.', 'A red coloring matter. extracted from the Bignonia Chica,\n   used by some tribes of South American Indians to stain the skin.'),
(13549, 'Chica', 'n.', 'A fermented liquor or beer made in South American from a\n   decoction of maize.'),
(13550, 'Chica', 'n.', 'A popular Moorish, Spanish, and South American dance, said\n   to be the original of the fandango, etc.'),
(13551, 'Chicane', 'n.', 'The use of artful subterfuge, designed to draw away\n   attention from the merits of a case or question; -- specifically\n   applied to legal proceedings; trickery; chicanery; caviling; sophistry.'),
(13552, 'Chicane', 'n.', 'To use shifts, cavils, or artifices.'),
(13553, 'Chicaner', 'n.', 'One who uses chicanery.'),
(13554, 'Chiccory', 'n.', 'See Chicory.'),
(13555, 'Chiches', 'pl. ', 'of Chich'),
(13556, 'Chich', 'n.', 'The chick-pea.'),
(13557, 'Chicha', 'n.', 'See Chica.'),
(13558, 'Chick', 'v. i.', 'To sprout, as seed in the ground; to vegetate.'),
(13559, 'Chick', 'n.', 'A chicken.'),
(13560, 'Chick', 'n.', 'A child or young person; -- a term of endearment.'),
(13561, 'Chicken', 'n.', 'A young bird or fowl, esp. a young barnyard fowl.'),
(13562, 'Chicken', 'n.', 'A young person; a child; esp. a young woman; a maiden.'),
(13563, 'Chicky', 'n.', 'A chicken; -- used as a diminutive or pet name, especially\n   in calling fowls.'),
(13564, 'Chicory', 'n.', 'A branching perennial plant (Cichorium Intybus) with\n   bright blue flowers, growing wild in Europe, Asia, and America; also\n   cultivated for its roots and as a salad plant; succory; wild endive.\n   See Endive.'),
(13565, 'Chicory', 'n.', 'The root, which is roasted for mixing with coffee.'),
(13566, 'Chide', 'p. pr. & vb. n.', 'To rebuke; to reprove; to scold; to find fault\n   with.'),
(13567, 'Chide', 'p. pr. & vb. n.', 'Fig.: To be noisy about; to chafe against.'),
(13568, 'Chide', 'v. i.', 'To utter words of disapprobation and displeasure; to find\n   fault; to contend angrily.'),
(13569, 'Chide', 'v. i.', 'To make a clamorous noise; to chafe.'),
(13570, 'Chide', 'n.', 'A continuous noise or murmur.'),
(13571, 'Chider', 'n.', 'One who chides or quarrels.'),
(13572, 'Chief', 'n.', 'The head or leader of any body of men; a commander, as of an\n   army; a head man, as of a tribe, clan, or family; a person in authority\n   who directs the work of others; the principal actor or agent.'),
(13573, 'Chief', 'n.', 'The principal part; the most valuable portion.'),
(13574, 'Chief', 'n.', 'The upper third part of the field. It is supposed to be\n   composed of the dexter, sinister, and middle chiefs.'),
(13575, 'Chief', 'a.', 'Highest in office or rank; principal; head.'),
(13576, 'Chief', 'a.', 'Principal or most eminent in any quality or action; most\n   distinguished; having most influence; taking the lead; most important;\n   as, the chief topic of conversation; the chief interest of man.'),
(13577, 'Chief', 'a.', 'Very intimate, near, or close.'),
(13578, 'Chiefage', 'n.', 'A tribute by the head; a capitation tax.'),
(13579, 'Chiefest', 'a.', 'First or foremost; chief; principal.'),
(13580, 'Chiefly', 'adv.', 'In the first place; principally; preeminently; above;\n   especially.'),
(13581, 'Chiefly', 'adv.', 'For the most part; mostly.'),
(13582, 'Chiefrie', 'n.', 'A small rent paid to the lord paramount.'),
(13583, 'Chierte', 'n.', 'Love; tender regard.'),
(13584, 'Chieve', 'v. i.', 'See Cheve, v. i.'),
(13585, 'Chiffo', 'n.', 'Alt. of niere'),
(13586, 'niere', 'n.', 'One who gathers rags and odds and ends; a ragpicker.'),
(13587, 'niere', 'n.', 'A receptacle for rags or shreds.'),
(13588, 'niere', 'n.', 'A movable and ornamental closet or piece of furniture with\n   shelves or drawers.'),
(13589, 'Chignon', 'n.', 'A knot, boss, or mass of hair, natural or artificial, worn\n   by a woman at the back of the head.'),
(13590, 'Chigoe', 'n.', 'Alt. of Chigre'),
(13591, 'Chigre', 'n.', 'A species of flea (Pulex penetrans), common in the West\n   Indies and South America, which often attacks the feet or any exposed\n   part of the human body, and burrowing beneath the skin produces great\n   irritation. When the female is allowed to remain and breed, troublesome\n   sores result, which are sometimes dangerous. See Jigger.'),
(13592, 'Chikara', 'n.', 'The goat antelope (Tragops Bennettii) of India.'),
(13593, 'Chikara', 'n.', 'The Indian four-horned antelope (Tetraceros quadricornis).'),
(13594, 'Children', 'pl. ', 'of Child'),
(13595, 'Child', 'n.', 'A son or a daughter; a male or female descendant, in the\n   first degree; the immediate progeny of human parents; -- in law,\n   legitimate offspring. Used also of animals and plants.'),
(13596, 'Child', 'n.', 'A descendant, however remote; -- used esp. in the plural;\n   as, the children of Israel; the children of Edom.'),
(13597, 'Child', 'n.', 'One who, by character of practice, shows signs of\n   relationship to, or of the influence of, another; one closely connected\n   with a place, occupation, character, etc.; as, a child of God; a child\n   of the devil; a child of disobedience; a child of toil; a child of the\n   people.'),
(13598, 'Child', 'n.', 'A noble youth. See Childe.'),
(13599, 'Child', 'n.', 'A young person of either sex. esp. one between infancy and\n   youth; hence, one who exhibits the characteristics of a very young\n   person, as innocence, obedience, trustfulness, limited understanding,\n   etc.'),
(13600, 'Child', 'n.', 'A female infant.'),
(13601, 'Childed', 'imp. & p. p.', 'of Child'),
(13602, 'Childing', 'p. pr. & vb. n.', 'of Child'),
(13603, 'Child', 'v. i.', 'To give birth; to produce young.'),
(13604, 'Childbed', 'n.', 'The state of a woman bringing forth a child, or being in\n   labor; parturition.'),
(13605, 'Childe', 'n.', 'A cognomen formerly prefixed to his name by the oldest son,\n   until he succeeded to his ancestral titles, or was knighted; as, Childe\n   Roland.'),
(13606, 'Childed', 'a.', 'Furnished with a child.'),
(13607, 'Childing', 'v. i.', 'Bearing Children; (Fig.) productive; fruitful.'),
(13608, 'Childish', 'a.', 'Of, pertaining to, befitting, or resembling, a child.'),
(13609, 'Childish', 'a.', 'Puerile; trifling; weak.'),
(13610, 'Childly', 'a.', 'Having the character of a child; belonging, or\n   appropriate, to a child.'),
(13611, 'Childly', 'adv.', 'Like a child.'),
(13612, 'Children', 'n.', 'pl. of Child.'),
(13613, 'Chili', 'n.', 'A kind of red pepper. See Capsicum'),
(13614, 'Chiliad', 'n.', 'A thousand; the aggregate of a thousand things;\n   especially, a period of a thousand years.'),
(13615, 'Chilian', 'a.', 'Of or pertaining to Chili.'),
(13616, 'Chilian', 'n.', 'A native or citizen of Chili.'),
(13617, 'Chilian', 'n.', 'Alt. of Chiliarch'),
(13618, 'Chiliasm', 'n.', 'The millennium.'),
(13619, 'Chiliasm', 'n.', 'The doctrine of the personal reign of Christ on earth\n   during the millennium.'),
(13620, 'Chiliast', 'n.', 'One who believes in the second coming of Christ to reign\n   on earth a thousand years; a milllenarian.'),
(13621, 'Chill', 'n.', 'A moderate but disagreeable degree of cold; a disagreeable\n   sensation of coolness, accompanied with shivering.'),
(13622, 'Chill', 'n.', 'A sensation of cold with convulsive shaking of the body,\n   pinched face, pale skin, and blue lips, caused by undue cooling of the\n   body or by nervous excitement, or forming the precursor of some\n   constitutional disturbance, as of a fever.'),
(13623, 'Chill', 'n.', 'A check to enthusiasm or warmth of feeling; discouragement;\n   as, a chill comes over an assembly.'),
(13624, 'Chill', 'n.', 'An iron mold or portion of a mold, serving to cool rapidly,\n   and so to harden, the surface of molten iron brought in contact with\n   it.'),
(13625, 'Chill', 'n.', 'The hardened part of a casting, as the tread of a car wheel.'),
(13626, 'Chill', 'a.', 'Moderately cold; tending to cause shivering; chilly; raw.'),
(13627, 'Chill', 'a.', 'Affected by cold.'),
(13628, 'Chill', 'a.', 'Characterized by coolness of manner, feeling, etc.; lacking\n   enthusiasm or warmth; formal; distant; as, a chill reception.'),
(13629, 'Chill', 'a.', 'Discouraging; depressing; dispiriting.'),
(13630, 'Chilled', 'imp. & p. p.', 'of Chill'),
(13631, 'Chilling', 'p. pr. & vb. n.', 'of Chill'),
(13632, 'Chill', 'v. t.', 'To strike with a chill; to make chilly; to cause to\n   shiver; to affect with cold.'),
(13633, 'Chill', 'v. t.', 'To check enthusiasm or warmth of feeling of; to depress;\n   to discourage.'),
(13634, 'Chill', 'v. t.', 'To produce, by sudden cooling, a change of\n   crystallization at or near the surface of, so as to increase the\n   hardness; said of cast iron.'),
(13635, 'Chill', 'v. i.', 'To become surface-hardened by sudden cooling while\n   solidifying; as, some kinds of cast iron chill to a greater depth than\n   others.'),
(13636, 'Chilled', 'a.', 'Hardened on the surface or edge by chilling; as, chilled\n   iron; a chilled wheel.'),
(13637, 'Chilled', 'a.', 'Having that cloudiness or dimness of surface that is\n   called \"blooming.\"'),
(13638, 'Chilli', 'n.', 'See Chili.'),
(13639, 'Chilling', 'a.', 'Making chilly or cold; depressing; discouraging; cold;\n   distant; as, a chilling breeze; a chilling manner.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(13640, 'Chilly', 'a.', 'Moderately cold; cold and raw or damp so as to cause\n   shivering; causing or feeling a disagreeable sensation of cold, or a\n   shivering.'),
(13641, 'Chiloma', 'n.', 'The tumid upper lip of certain mammals, as of a camel.'),
(13642, 'Chilopod', 'n.', 'A myriapod of the order Chilopoda.'),
(13643, 'Chimaera', 'n.', 'A cartilaginous fish of several species, belonging to the\n   order Holocephali. The teeth are few and large. The head is furnished\n   with appendages, and the tail terminates in a point.'),
(13644, 'Chimango', '', 'A south American carrion buzzard (Milvago chimango). See\n   Caracara.'),
(13645, 'Chimb', 'n.', 'The edge of a cask, etc; a chine. See Chine, n., 3.'),
(13646, 'Chimb', 'v. i.', 'Chime.'),
(13647, 'Chime', 'n.', 'See Chine, n., 3.'),
(13648, 'Chime', 'n.', 'The harmonious sound of bells, or of musical instruments.'),
(13649, 'Chime', 'n.', 'A set of bells musically tuned to each other; specif., in\n   the pl., the music performed on such a set of bells by hand, or\n   produced by mechanism to accompany the striking of the hours or their\n   divisions.'),
(13650, 'Chime', 'n.', 'Pleasing correspondence of proportion, relation, or sound.'),
(13651, 'Chimed', 'imp. & p. p.', 'of Chime'),
(13652, 'Chiming', 'p. pr. & vb. n.', 'of Chime'),
(13653, 'Chime', 'n.', 'To sound in harmonious accord, as bells.'),
(13654, 'Chime', 'n.', 'To be in harmony; to agree; to suit; to harmonize; to\n   correspond; to fall in with.'),
(13655, 'Chime', 'n.', 'To join in a conversation; to express assent; -- followed by\n   in or in with.'),
(13656, 'Chime', 'n.', 'To make a rude correspondence of sounds; to jingle, as in\n   rhyming.'),
(13657, 'Chime', 'v. i.', 'To cause to sound in harmony; to play a tune, as upon a\n   set of bells; to move or strike in harmony.'),
(13658, 'Chime', 'v. i.', 'To utter harmoniously; to recite rhythmically.'),
(13659, 'Chimer', 'n.', 'One who chimes.'),
(13660, 'Chimeras', 'pl. ', 'of Chimera'),
(13661, 'Chimera', 'n.', 'A monster represented as vomiting flames, and as having\n   the head of a lion, the body of a goat, and the tail of a dragon.'),
(13662, 'Chimera', 'n.', 'A vain, foolish, or incongruous fancy, or creature of the\n   imagination; as, the chimera of an author.'),
(13663, 'Chimere', 'n.', 'The upper robe worn by a bishop, to which lawn sleeves are\n   usually attached.'),
(13664, 'Chimeric', 'a.', 'Chimerical.'),
(13665, 'Chimneys', 'pl. ', 'of Chimney'),
(13666, 'Chimney', 'n.', 'A fireplace or hearth.'),
(13667, 'Chimney', 'n.', 'That part of a building which contains the smoke flues;\n   esp. an upright tube or flue of brick or stone, in most cases extending\n   through or above the roof of the building. Often used instead of\n   chimney shaft.'),
(13668, 'Chimney', 'n.', 'A tube usually of glass, placed around a flame, as of a\n   lamp, to create a draft, and promote combustion.'),
(13669, 'Chimney', 'n.', 'A body of ore, usually of elongated form, extending\n   downward in a vein.'),
(13670, 'China', 'n.', 'A country in Eastern Asia.'),
(13671, 'China', 'n.', 'China ware, which is the modern popular term for porcelain.\n   See Porcelain.'),
(13672, 'Chinamen', 'pl. ', 'of Chinaman'),
(13673, 'Chinaman', 'n.', 'A native of China; a Chinese.'),
(13674, 'Chinch', 'n.', 'The bedbug (Cimex lectularius).'),
(13675, 'Chinch', 'n.', 'A bug (Blissus leucopterus), which, in the United States,\n   is very destructive to grass, wheat, and other grains; -- also called\n   chiniz, chinch bug, chink bug. It resembles the bedbug in its\n   disgusting odor.'),
(13676, 'Chincha', 'n.', 'A south American rodent of the genus Lagotis.'),
(13677, 'Chinche', 'a.', 'Parsimonious; niggardly.'),
(13678, 'Chincona', '', 'See Cinchona.'),
(13679, 'Chine', 'n.', 'A chink or cleft; a narrow and deep ravine; as, Shanklin\n   Chine in the Isle of Wight, a quarter of a mile long and 230 feet deep.'),
(13680, 'Chine', 'n.', 'The backbone or spine of an animal; the back.'),
(13681, 'Chine', 'n.', 'A piece of the backbone of an animal, with the adjoining\n   parts, cut for cooking. [See Illust. of Beef.]'),
(13682, 'Chine', 'n.', 'The edge or rim of a cask, etc., formed by the projecting\n   ends of the staves; the chamfered end of a stave.'),
(13683, 'Chined', 'imp. & p. p.', 'of Chine'),
(13684, 'Chine', 'v. t.', 'To cut through the backbone of; to cut into chine pieces.'),
(13685, 'Chine', 'v. t.', 'Too chamfer the ends of a stave and form the chine..'),
(13686, 'Chined', 'a.', 'Pertaining to, or having, a chine, or backbone; -- used in\n   composition.'),
(13687, 'Chined', 'a.', 'Broken in the back.'),
(13688, 'Chinese', 'a.', 'Of or pertaining to China; peculiar to China.'),
(13689, 'Chinese', 'n. sing. & pl.', 'A native or natives of China, or one of that\n   yellow race with oblique eyelids who live principally in China.'),
(13690, 'Chinese', 'n. sing. & pl.', 'The language of China, which is monosyllabic.'),
(13691, 'Chink', 'n.', 'A small cleft, rent, or fissure, of greater length than\n   breadth; a gap or crack; as, the chinks of wall.'),
(13692, 'Chinked', 'imp. & p. p.', 'of Chink'),
(13693, 'Chinking', 'p. pr. & vb. n.', 'of Chink'),
(13694, 'Chink', 'v. i.', 'To crack; to open.'),
(13695, 'Chink', 'v. t.', 'To cause to open in cracks or fissures.'),
(13696, 'Chink', 'v. t.', 'To fill up the chinks of; as, to chink a wall.'),
(13697, 'Chink', 'n.', 'A short, sharp sound, as of metal struck with a slight\n   degree of violence.'),
(13698, 'Chink', 'n.', 'Money; cash.'),
(13699, 'Chink', 'v. t.', 'To cause to make a sharp metallic sound, as coins, small\n   pieces of metal, etc., by bringing them into collision with each other.'),
(13700, 'Chink', 'v. i.', 'To make a slight, sharp, metallic sound, as by the\n   collision of little pieces of money, or other small sonorous bodies.'),
(13701, 'Chinky', 'a.', 'Full of chinks or fissures; gaping; opening in narrow\n   clefts.'),
(13702, 'Chinned', 'a.', 'Having a chin; -- used chiefly in compounds; as,\n   short-chinned.'),
(13703, 'Chinone', 'n.', 'See Quinone.'),
(13704, 'Chinook', 'n.', 'One of a tribe of North American Indians now living in the\n   state of Washington, noted for the custom of flattening their skulls.\n   Chinooks also called Flathead Indians.'),
(13705, 'Chinook', 'n.', 'A warm westerly wind from the country of the Chinooks,\n   sometimes experienced on the slope of the Rocky Mountains, in Montana\n   and the adjacent territory.'),
(13706, 'Chinook', 'n.', 'A jargon of words from various languages (the largest\n   proportion of which is from that of the Chinooks) generally understood\n   by all the Indian tribes of the northwestern territories of the United\n   States.'),
(13707, 'Chinsed', 'imp. & p. p.', 'of Chinse'),
