(13946, 'Christen', 'v. t.', 'To give a name; to denominate.'),
(13947, 'Christen', 'v. t.', 'To Christianize.'),
(13948, 'Christen', 'v. t.', 'To use for the first time.'),
(13949, 'Christly', 'a.', 'Christlike.'),
(13950, 'Christom', 'n.', 'See Chrisom.'),
(13951, 'Chromate', 'n.', 'A salt of chromic acid.'),
(13952, 'Chrome', 'n.', 'Same as Chromium.'),
(13953, 'Chromic', 'a.', 'Pertaining to, or obtained from, chromium; -- said of the\n   compounds of chromium in which it has its higher valence.'),
(13954, 'Chromid', 'n.', 'One of the Chromidae, a family of fresh-water fishes\n   abundant in the tropical parts of America and Africa. Some are valuable\n   food fishes, as the bulti of the Nile.'),
(13955, 'Chromism', 'n.', 'Same as Chromatism.'),
(13956, 'Chromite', 'n.', 'A black submetallic mineral consisting of oxide of\n   chromium and iron; -- called also chromic iron.'),
(13957, 'Chromite', 'n.', 'A compound or salt of chromous hydroxide regarded as an\n   acid.'),
(13958, 'Chromium', 'n.', 'A comparatively rare element occurring most abundantly in\n   the mineral chromite. Atomic weight 52.5. Symbol Cr. When isolated it\n   is a hard, brittle, grayish white metal, fusible with difficulty. Its\n   chief commercial importance is for its compounds, as potassium\n   chromate, lead chromate, etc., which are brilliantly colored and are\n   used dyeing and calico printing. Called also chrome.'),
(13959, 'Chromos', 'pl. ', 'of Chromo'),
(13960, 'Chromo', 'n.', 'A chromolithograph.'),
(13961, 'Chromous', 'a.', 'Of, pertaining to, or derived from, chromium, when this\n   element has a valence lower than that in chromic compounds.'),
(13962, 'Chromule', 'n.', 'A general name for coloring matter of plants other than\n   chlorophyll, especially that of petals.'),
(13963, 'Chronic', 'a.', 'Relating to time; according to time.'),
(13964, 'Chronic', 'a.', 'Continuing for a long time; lingering; habitual.'),
(13965, 'Chrysene', 'n.', 'One of the higher aromatic hydrocarbons of coal tar,\n   allied to naphthalene and anthracene. It is a white crystalline\n   substance, C18H12, of strong blue fluorescence, but generally colored\n   yellow by impurities.'),
(13966, 'Chrysopa', 'n.', 'A genus of neuropterous insects. See Lacewing.'),
(13967, 'Chthonic', 'a.', 'Pertaining to the earth; earthy; as, chthonic religions.'),
(13968, 'Chubbed', 'a.', 'Chubby.'),
(13969, 'Chubby', 'a.', 'Like a chub; plump, short, and thick.'),
(13970, 'Chucked', 'imp. & p. p.', 'of Chuck'),
(13971, 'Chucking', 'p. pr. & vb. n.', 'of Chuck'),
(13972, 'Chuck', 'v. i.', 'To make a noise resembling that of a hen when she calls\n   her chickens; to cluck.'),
(13973, 'Chuck', 'v. i.', 'To chuckle; to laugh.'),
(13974, 'Chuck', 'v. t.', 'To call, as a hen her chickens.'),
(13975, 'Chuck', 'n.', 'The chuck or call of a hen.'),
(13976, 'Chuck', 'n.', 'A sudden, small noise.'),
(13977, 'Chuck', 'n.', 'A word of endearment; -- corrupted from chick.'),
(13978, 'Chucked', 'imp. & p. p.', 'of Chuck'),
(13979, 'Chucking', 'p. pr. & vb. n.', 'of Chuck'),
(13980, 'Chuck', 'v. t.', 'To strike gently; to give a gentle blow to.'),
(13981, 'Chuck', 'v. t.', 'To toss or throw smartly out of the hand; to pitch.'),
(13982, 'Chuck', 'v. t.', 'To place in a chuck, or hold by means of a chuck, as in\n   turning; to bore or turn (a hole) in a revolving piece held in a chuck.'),
(13983, 'Chuck', 'n.', 'A slight blow or pat under the chin.'),
(13984, 'Chuck', 'n.', 'A short throw; a toss.'),
(13985, 'Chuck', 'n.', 'A contrivance or machine fixed to the mandrel of a lathe,\n   for holding a tool or the material to be operated upon.'),
(13986, 'Chuck', 'n.', 'A small pebble; -- called also chuckstone and chuckiestone.'),
(13987, 'Chuck', 'n.', 'A game played with chucks, in which one or more are tossed\n   up and caught; jackstones.'),
(13988, 'Chuck', 'n.', 'A piece of the backbone of an animal, from between the neck\n   and the collar bone, with the adjoining parts, cut for cooking; as, a\n   chuck steak; a chuck roast.'),
(13989, 'Chuckled', 'imp. & p. p.', 'of Chuckle'),
(13990, 'Chuckle', 'v. t.', 'To call, as a hen her chickens; to cluck.'),
(13991, 'Chuckle', 'v. t.', 'To fondle; to cocker.'),
(13992, 'Chuckle', 'n.', 'A short, suppressed laugh; the expression of satisfaction,\n   exultation, or derision.'),
(13993, 'Chuckle', 'v. i.', 'To laugh in a suppressed or broken manner, as\n   expressing inward satisfaction, exultation, or derision.'),
(13994, 'Chuet', 'n.', 'Minced meat.'),
(13995, 'Chufa', 'n.', 'A sedgelike plant (Cyperus esculentus) producing edible\n   tubers, native about the Mediterranean, now cultivated in many regions;\n   the earth almond.'),
(13996, 'Chuff', 'n.', 'A coarse or stupid fellow.'),
(13997, 'Chuff', 'a.', 'Stupid; churlish.'),
(13998, 'Chuffily', 'adv.', 'Clownishly; surlily.'),
(13999, 'Chuffy', 'a.', 'Fat or puffed out in the cheeks.'),
(14000, 'Chuffy', 'a.', 'Rough; clownish; surly.'),
(14001, 'Chulan', 'n.', 'The fragrant flowers of the Chloranthus inconspicuus, used\n   in China for perfuming tea.'),
(14002, 'Chummed', 'imp. p. p.', 'of Chum'),
(14003, 'Chumming', 'p. pr. & vb. n.', 'of Chum'),
(14004, 'Chump', 'n.', 'A short, thick, heavy piece of wood.'),
(14005, 'Chunam', 'n.', 'Quicklime; also, plaster or mortar.'),
(14006, 'Chunk', 'n.', 'A short, thick piece of anything.'),
(14007, 'Chunky', 'a.', 'Short and thick.'),
(14008, 'Church', 'n.', 'A building set apart for Christian worship.'),
(14009, 'Church', 'n.', 'A Jewish or heathen temple.'),
(14010, 'Church', 'n.', 'A formally organized body of Christian believers worshiping\n   together.'),
(14011, 'Church', 'n.', 'A body of Christian believers, holding the same creed,\n   observing the same rites, and acknowledging the same ecclesiastical\n   authority; a denomination; as, the Roman Catholic church; the\n   Presbyterian church.'),
(14012, 'Church', 'n.', 'The collective body of Christians.'),
(14013, 'Church', 'n.', 'Any body of worshipers; as, the Jewish church; the church\n   of Brahm.'),
(14014, 'Church', 'n.', 'The aggregate of religious influences in a community;\n   ecclesiastical influence, authority, etc.; as, to array the power of\n   the church against some moral evil.'),
(14015, 'Churched', 'imp. & p. p.', 'of Church'),
(14016, 'Church', 'v. t.', 'To bless according to a prescribed form, or to unite\n   with in publicly returning thanks in church, as after deliverance from\n   the dangers of childbirth; as, the churching of women.'),
(14017, 'Churchly', 'a.', 'Pertaining to, or suitable for, the church;\n   ecclesiastical.'),
(14018, 'Churchy', 'a.', 'Relating to a church; unduly fond of church forms.'),
(14019, 'Churl', 'n.', 'A rustic; a countryman or laborer.'),
(14020, 'Churl', 'n.', 'A rough, surly, ill-bred man; a boor.'),
(14021, 'Churl', 'n.', 'A selfish miser; an illiberal person; a niggard.'),
(14022, 'Churl', 'a.', 'Churlish; rough; selfish.'),
(14023, 'Churlish', 'a.', 'Like a churl; rude; cross-grained; ungracious; surly;\n   illiberal; niggardly.'),
(14024, 'Churlish', 'a.', 'Wanting pliancy; unmanageable; unyielding; not easily\n   wrought; as, a churlish soil; the churlish and intractable nature of\n   some minerals.'),
(14025, 'Churly', 'a.', 'Rude; churlish; violent.'),
(14026, 'Churme', 'n.', 'Alt. of Chirm'),
(14027, 'Chirm', 'n.', 'Clamor, or confused noise; buzzing.'),
(14028, 'Churn', 'v. t.', 'A vessel in which milk or cream is stirred, beaten, or\n   otherwise agitated (as by a plunging or revolving dasher) in order to\n   separate the oily globules from the other parts, and obtain butter.'),
(14029, 'Churned', 'imp. & p. p.', 'of Churn'),
(14030, 'Churning', 'p. pr. & vb. n.', 'of Churn'),
(14031, 'Churn', 'v. t.', 'To stir, beat, or agitate, as milk or cream in a churn,\n   in order to make butter.'),
(14032, 'Churn', 'v. t.', 'To shake or agitate with violence.'),
(14033, 'Churn', 'v. i.', 'To perform the operation of churning.'),
(14034, 'Churning', 'n.', 'The act of one who churns.'),
(14035, 'Churning', 'n.', 'The quantity of butter made at one operation.'),
(14036, 'Churrus', 'n.', 'A powerfully narcotic and intoxicating gum resin which\n   exudes from the flower heads, seeds, etc., of Indian hemp.'),
(14037, 'Chuse', 'v. t.', 'See Choose.'),
(14038, 'Chute', 'n.', 'A framework, trough, or tube, upon or through which objects\n   are made to slide from a higher to a lower level, or through which\n   water passes to a wheel.'),
(14039, 'Chute', 'n.', 'See Shoot.'),
(14040, 'Chutney', 'n.', 'Alt. of Chutnee'),
(14041, 'Chutnee', 'n.', 'A warm or spicy condiment or pickle made in India,\n   compounded of various vegetable substances, sweets, acids, etc.'),
(14042, 'Chyle', 'n.', 'A milky fluid containing the fatty matter of the food in a\n   state of emulsion, or fine mechanical division; formed from chyme by\n   the action of the intestinal juices. It is absorbed by the lacteals,\n   and conveyed into the blood by the thoracic duct.'),
(14043, 'Chylific', 'a.', 'Chylifactive.'),
(14044, 'Chylify', 'v. t. & i.', 'To make chyle of; to be converted into chyle.'),
(14045, 'Chylous', 'a.', 'Consisting of, or similar to, chyle.'),
(14046, 'Chyluria', 'n.', 'A morbid condition in which the urine contains chyle or\n   fatty matter, giving it a milky appearance.'),
(14047, 'Chyme', 'n.', 'The pulpy mass of semi-digested food in the small intestines\n   just after its passage from the stomach. It is separated in the\n   intestines into chyle and excrement. See Chyle.'),
(14048, 'Chymic', '', 'Alt. of Chymistry'),
(14049, 'Chymist', '', 'Alt. of Chymistry'),
(14050, 'Chymify', 'v. t.', 'To form into chyme.'),
(14051, 'Chymous', 'a.', 'Of or pertaining to chyme.'),
(14052, 'Cibation', 'n.', 'The act of taking food.'),
(14053, 'Cibation', 'n.', 'The process or operation of feeding the contents of the\n   crucible with fresh material.'),
(14054, 'Cibol', 'n.', 'A perennial alliaceous plant (Allium fistulosum), sometimes\n   called Welsh onion. Its fistular leaves areused in cookery.'),
(14055, 'Ciboria', 'pl. ', 'of Ciborium'),
(14056, 'Ciborium', 'n.', 'A canopy usually standing free and supported on four\n   columns, covering the high altar, or, very rarely, a secondary altar.'),
(14057, 'Ciborium', 'n.', 'The coffer or case in which the host is kept; the pyx.'),
(14058, 'Cicadas', 'pl. ', 'of Cicada'),
(14059, 'Cicadae', 'pl. ', 'of Cicada'),
(14060, 'Cicada', 'n.', 'Any species of the genus Cicada. They are large hemipterous\n   insects, with nearly transparent wings. The male makes a shrill sound\n   by peculiar organs in the under side of the abdomen, consisting of a\n   pair of stretched membranes, acted upon by powerful muscles. A noted\n   American species (C. septendecim) is called the seventeen year locust.\n   Another common species is the dogday cicada.'),
(14061, 'Cicala', 'n.', 'A cicada. See Cicada.'),
(14062, 'Cicatrix', 'n.', 'The pellicle which forms over a wound or breach of\n   continuity and completes the process of healing in the latter, and\n   which subsequently contracts and becomes white, forming the scar.'),
(14063, 'Cicely', 'n.', 'Any one of several umbelliferous plants, of the genera\n   Myrrhis, Osmorrhiza, etc.'),
(14064, 'Cicero', 'n.', 'Pica type; -- so called by French printers.'),
(14065, 'Ciceroni', 'pl. ', 'of Cicerone'),
(14066, 'Cicerone', 'n.', 'One who shows strangers the curiosities of a place; a\n   guide.'),
(14067, 'Cich-pea', 'n.', 'The chick-pea.'),
(14068, 'Cicisbei', 'pl. ', 'of Cicisbeo'),
(14069, 'Cicisbeo', 'n.', 'A professed admirer of a married woman; a dangler about\n   women.'),
(14070, 'Cicisbeo', 'n.', 'A knot of silk or ribbon attached to a fan, walking\n   stick, etc.'),
(14071, 'Cicurate', 'v. t.', 'To tame.'),
(14072, 'Cicuta', 'n.', 'a genus of poisonous umbelliferous plants, of which the\n   water hemlock or cowbane is best known.'),
(14073, 'Cider', 'n.', 'The expressed juice of apples. It is used as a beverage, for\n   making vinegar, and for other purposes.'),
(14074, 'Ciderist', 'n.', 'A maker of cider.'),
(14075, 'Ciderkin', 'n.', 'A kind of weak cider made by steeping the refuse pomace\n   in water.'),
(14076, 'Cierge', 'n.', 'A wax candle used in religous rites.'),
(14077, 'Cigar', 'n.', 'A small roll of tobacco, used for smoking.'),
(14078, 'Cilia', 'n. pl.', 'The eyelashes.'),
(14079, 'Cilia', 'n. pl.', 'Small, generally microscopic, vibrating appendages\n   lining certain organs, as the air passages of the higher animals, and\n   in the lower animals often covering also the whole or a part of the\n   exterior. They are also found on some vegetable organisms. In the\n   Infusoria, and many larval forms, they are locomotive organs.'),
(14080, 'Cilia', 'n. pl.', 'Hairlike processes, commonly marginal and forming a\n   fringe like the eyelash.'),
(14081, 'Cilia', 'n. pl.', 'Small, vibratory, swimming organs, somewhat resembling\n   true cilia, as those of Ctenophora.'),
(14082, 'Ciliary', 'a.', 'Pertaining to the cilia, or eyelashes. Also applied to\n   special parts of the eye itself; as, the ciliary processes of the\n   choroid coat; the ciliary muscle, etc.'),
(14083, 'Ciliary', 'a.', 'Pertaining to or connected with the cilia in animal or\n   vegetable organisms; as, ciliary motion.'),
(14084, 'Ciliata', 'n. pl.', 'One of the orders of Infusoria, characterized by\n   having cilia. In some species the cilia cover the body generally, in\n   others they form a band around the mouth.'),
(14085, 'Ciliate', 'a.', 'Alt. of Ciliated'),
(14086, 'Ciliated', 'a.', 'Provided with, or surrounded by, cilia; as, a ciliate\n   leaf; endowed with vibratory motion; as, the ciliated epithelium of the\n   windpipe.'),
(14087, 'Cilice', 'n.', 'A kind of haircloth undergarment.'),
(14088, 'Cilician', 'a.', 'Of or pertaining to Cilicia in Asia Minor.'),
(14089, 'Cilician', 'n.', 'A native or inhabitant of Cilicia.'),
(14090, 'Ciliform', 'a.', 'Alt. of Ciliiform'),
(14091, 'Cilium', 'n.', 'See Cilia.'),
(14092, 'Cillosis', 'n.', 'A spasmodic trembling of the upper eyelid.'),
(14093, 'Cimar', 'n.', 'See Simar.'),
(14094, 'Cimbal', 'n.', 'A kind of confectionery or cake.'),
(14095, 'Cimbia', 'n.', 'A fillet or band placed around the shaft of a column as if\n   to strengthen it.'),
(14096, 'Cimbrian', 'a.', 'Of or pertaining to the Cimbri.'),
(14097, 'Cimbrian', 'n.', 'One of the Cimbri. See Cimbric.'),
(14098, 'Cimbric', 'a.', 'Pertaining to the Cimbri, an ancient tribe inhabiting\n   Northern Germany.'),
(14099, 'Cimbric', 'n.', 'The language of the Cimbri.'),
(14100, 'Cimeter', 'n.', 'See Scimiter.'),
(14101, 'Cimices', 'pl. ', 'of Cimex'),
(14102, 'Cimex', 'n.', 'A genus of hemipterous insects of which the bedbug is the\n   best known example. See Bedbug.'),
(14103, 'Cimia', 'n.', 'See Cimbia.'),
(14104, 'Cimiss', 'n.', 'The bedbug.'),
(14105, 'Cimolite', 'n.', 'A soft, earthy, clayey mineral, of whitish or grayish\n   color.'),
(14106, 'Cinch', 'n.', 'A strong saddle girth, as of canvas.'),
(14107, 'Cinch', 'n.', 'A tight grip.'),
(14108, 'Cinchona', 'n.', 'A genus of trees growing naturally on the Andes in Peru\n   and adjacent countries, but now cultivated in the East Indies,\n   producing a medicinal bark of great value.'),
(14109, 'Cinchona', 'n.', 'The bark of any species of Cinchona containing three per\n   cent. or more of bitter febrifuge alkaloids; Peruvian bark; Jesuits\'\n   bark.'),
(14110, 'Cincture', 'n.', 'A belt, a girdle, or something worn round the body, -- as\n   by an ecclesiastic for confining the alb.'),
(14111, 'Cincture', 'n.', 'That which encompasses or incloses; an inclosure.'),
(14112, 'Cincture', 'n.', 'The fillet, listel, or band next to the apophyge at the\n   extremity of the shaft of a column.'),
(14113, 'Cinder', 'n.', 'Partly burned or vitrified coal, or other combustible, in\n   which fire is extinct.'),
(14114, 'Cinder', 'n.', 'A hot coal without flame; an ember.'),
(14115, 'Cinder', 'n.', 'A scale thrown off in forging metal.'),
(14116, 'Cinder', 'n.', 'The slag of a furnace, or scoriaceous lava from a volcano.'),
(14117, 'Cindery', 'a.', 'Resembling, or composed of, cinders; full of cinders.'),
(14118, 'Cinerary', 'a.', 'Pertaining to ashes; containing ashes.'),
(14119, 'Cingle', 'n.', 'A girth.'),
(14120, 'Cingulum', 'n.', 'A distinct girdle or band of color; a raised spiral line\n   as seen on certain univalve shells.'),
(14121, 'Cingulum', 'n.', 'The clitellus of earthworms.'),
(14122, 'Cingulum', 'n.', 'The base of the crown of a tooth.'),
(14123, 'Cinnabar', 'n.', 'Red sulphide of mercury, occurring in brilliant red\n   crystals, and also in red or brown amorphous masses. It is used in\n   medicine.'),
(14124, 'Cinnabar', 'n.', 'The artificial red sulphide of mercury used as a pigment;\n   vermilion.'),
(14125, 'Cinnamic', 'a.', 'Pertaining to, or obtained from, cinnamon.'),
(14126, 'Cinnamon', 'n.', 'The inner bark of the shoots of Cinnamomum Zeylanicum, a\n   tree growing in Ceylon. It is aromatic, of a moderately pungent taste,\n   and is one of the best cordial, carminative, and restorative spices.'),
(14127, 'Cinnamon', 'n.', 'Cassia.'),
(14128, 'Cinnamyl', 'n.', 'The hypothetical radical, (C6H5.C2H2)2C, of cinnamic\n   compounds.'),
(14129, 'Cinque', 'n.', 'Five; the number five in dice or cards.'),
(14130, 'Cinter', 'n.', 'See Center.'),
(14131, 'Cinura', 'n. pl.', 'The group of Thysanura which includes Lepisma and\n   allied forms; the bristletails. See Bristletail, and Lepisma.'),
(14132, 'Cipher', 'n.', 'A character [0] which, standing by itself, expresses\n   nothing, but when placed at the right hand of a whole number, increases\n   its value tenfold.'),
(14133, 'Cipher', 'n.', 'One who, or that which, has no weight or influence.'),
(14134, 'Cipher', 'n.', 'A character in general, as a figure or letter.'),
(14135, 'Cipher', 'n.', 'A combination or interweaving of letters, as the initials\n   of a name; a device; a monogram; as, a painter\'s cipher, an engraver\'s\n   cipher, etc. The cut represents the initials N. W.'),
(14136, 'Cipher', 'n.', 'A private alphabet, system of characters, or other mode of\n   writing, contrived for the safe transmission of secrets; also, a\n   writing in such characters.'),
(14137, 'Cipher', 'a.', 'Of the nature of a cipher; of no weight or influence.'),
(14138, 'Ciphered', 'imp. & p. p.', 'of Cipher'),
(14139, 'Cipher', 'v. i.', 'To use figures in a mathematical process; to do sums in\n   arithmetic.'),
(14140, 'Cipher', 'v. t.', 'To write in occult characters.'),
(14141, 'Cipher', 'v. t.', 'To get by ciphering; as, to cipher out the answer.'),
(14142, 'Cipher', 'v. t.', 'To decipher.'),
(14143, 'Cipher', 'v. t.', 'To designate by characters.'),
(14144, 'Cipherer', 'n.', 'One who ciphers.'),
(14145, 'Cipolin', 'n.', 'A whitish marble, from Rome, containiing pale greenish\n   zones. It consists of calcium carbonate, with zones and cloudings of\n   talc.'),
(14146, 'Cippi', 'pl. ', 'of Cippus'),
(14147, 'Cippus', 'n.', 'A small, low pillar, square or round, commonly having an\n   inscription, used by the ancients for various purposes, as for\n   indicating the distances of places, for a landmark, for sepulchral\n   inscriptions, etc.'),
(14148, 'Circar', 'n.', 'A district, or part of a province. See Sircar.'),
(14149, 'Circean', 'a.', 'Having the characteristics of Circe, daughter of Sol and\n   Perseis, a mythological enchantress, who first charmed her victims and\n   then changed them to the forms of beasts; pleasing, but noxious; as, a\n   Circean draught.'),
(14150, 'Circinal', 'a.', 'Circinate.'),
(14151, 'Circle', 'n.', 'A plane figure, bounded by a single curve line called its\n   circumference, every part of which is equally distant from a point\n   within it, called the center.'),
(14152, 'Circle', 'n.', 'The line that bounds such a figure; a circumference; a\n   ring.'),
(14153, 'Circle', 'n.', 'An instrument of observation, the graduated limb of which\n   consists of an entire circle.'),
(14154, 'Circle', 'n.', 'A round body; a sphere; an orb.'),
(14155, 'Circle', 'n.', 'Compass; circuit; inclosure.'),
(14156, 'Circle', 'n.', 'A company assembled, or conceived to assemble, about a\n   central point of interest, or bound by a common tie; a class or\n   division of society; a coterie; a set.'),
(14157, 'Circle', 'n.', 'A circular group of persons; a ring.'),
(14158, 'Circle', 'n.', 'A series ending where it begins, and repeating itself.'),
(14159, 'Circle', 'n.', 'A form of argument in which two or more unproved statements\n   are used to prove each other; inconclusive reasoning.'),
(14160, 'Circle', 'n.', 'Indirect form of words; circumlocution.'),
(14161, 'Circle', 'n.', 'A territorial division or district.'),
(14162, 'Circled', 'imp. & p. p.', 'of Circle'),
(14163, 'Circling', 'p. pr. & vb. n.', 'of Circle'),
(14164, 'Circle', 'n.', 'To move around; to revolve around.'),
(14165, 'Circle', 'n.', 'To encompass, as by a circle; to surround; to inclose; to\n   encircle.'),
(14166, 'Circle', 'v. i.', 'To move circularly; to form a circle; to circulate.'),
(14167, 'Circled', 'a.', 'Having the form of a circle; round.'),
(14168, 'Circler', 'n.', 'A mean or inferior poet, perhaps from his habit of\n   wandering around as a stroller; an itinerant poet. Also, a name given\n   to the cyclic poets. See under Cyclic, a.'),
(14169, 'Circlet', 'n.', 'A little circle; esp., an ornament for the person, having\n   the form of a circle; that which encircles, as a ring, a bracelet, or a\n   headband.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(14170, 'Circlet', 'n.', 'A round body; an orb.'),
(14171, 'Circlet', 'n.', 'A circular piece of wood put under a dish at table.'),
(14172, 'Circuit', 'n.', 'The act of moving or revolving around, or as in a circle\n   or orbit; a revolution; as, the periodical circuit of the earth round\n   the sun.'),
(14173, 'Circuit', 'n.', 'The circumference of, or distance round, any space; the\n   measure of a line round an area.'),
(14174, 'Circuit', 'n.', 'That which encircles anything, as a ring or crown.'),
(14175, 'Circuit', 'n.', 'The space inclosed within a circle, or within limits.'),
(14176, 'Circuit', 'n.', 'A regular or appointed journeying from place to place in\n   the exercise of one\'s calling, as of a judge, or a preacher.'),
(14177, 'Circuit', 'n.', 'A certain division of a state or country, established by\n   law for a judge or judges to visit, for the administration of justice.'),
(14178, 'Circuit', 'n.', 'A district in which an itinerant preacher labors.'),
(14179, 'Circuit', 'n.', 'Circumlocution.'),
(14180, 'Circuit', 'v. i.', 'To move in a circle; to go round; to circulate.'),
(14181, 'Circuit', 'v. t.', 'To travel around.'),
(14182, 'Circuity', 'n.', 'A going round in a circle; a course not direct; a\n   roundabout way of proceeding.'),
(14183, 'Circular', 'a.', 'In the form of, or bounded by, a circle; round.'),
(14184, 'Circular', 'a.', 'repeating itself; ending in itself; reverting to the\n   point of beginning; hence, illogical; inconclusive; as, circular\n   reasoning.'),
(14185, 'Circular', 'a.', 'Adhering to a fixed circle of legends; cyclic; hence,\n   mean; inferior. See Cyclic poets, under Cyclic.'),
(14186, 'Circular', 'a.', 'Addressed to a circle, or to a number of persons having a\n   common interest; circulated, or intended for circulation; as, a\n   circular letter.'),
(14187, 'Circular', 'a.', 'Perfect; complete.'),
