(14681, 'Cling', 'n.', 'Adherence; attachment; devotion.'),
(14682, 'Clingy', 'a.', 'Apt to cling; adhesive.'),
(14683, 'Clinic', 'n.', 'One confined to the bed by sickness.'),
(14684, 'Clinic', 'n.', 'One who receives baptism on a sick bed.'),
(14685, 'Clinic', 'n.', 'A school, or a session of a school or class, in which\n   medicine or surgery is taught by the examination and treatment of\n   patients in the presence of the pupils.'),
(14686, 'Clinical', 'v. i.', 'Alt. of Clinic'),
(14687, 'Clinic', 'v. i.', 'Of or pertaining to a bed, especially, a sick bed.'),
(14688, 'Clinic', 'v. i.', 'Of or pertaining to a clinic, or to the study of disease\n   in the living subject.'),
(14689, 'Clinique', 'n.', 'A clinic.'),
(14690, 'Clinium', 'n.', 'See Clinanthium.'),
(14691, 'Clinked', 'imp. & p. p.', 'of Clink'),
(14692, 'Clinking', 'p. pr. & vb. n.', 'of Clink'),
(14693, 'Clink', 'v. i.', 'To cause to give out a slight, sharp, tinkling, sound, as\n   by striking metallic or other sonorous bodies together.'),
(14694, 'Clink', 'v. i.', 'To give out a slight, sharp, tinkling sound.'),
(14695, 'Clink', 'v. i.', 'To rhyme. [Humorous].'),
(14696, 'Clink', 'n.', 'A slight, sharp, tinkling sound, made by the collision of\n   sonorous bodies.'),
(14697, 'Clinkant', 'a.', 'See Clinquant.'),
(14698, 'Clinker', 'n.', 'A mass composed of several bricks run together by the\n   action of the fire in the kiln.'),
(14699, 'Clinker', 'n.', 'Scoria or vitrified incombustible matter, formed in a\n   grate or furnace where anthracite coal in used; vitrified or burnt\n   matter ejected from a volcano; slag.'),
(14700, 'Clinker', 'n.', 'A scale of oxide of iron, formed in forging.'),
(14701, 'Clinker', 'n.', 'A kind of brick. See Dutch clinker, under Dutch.'),
(14702, 'Clinoid', 'a.', 'Like a bed; -- applied to several processes on the inner\n   side of the sphenoid bone.'),
(14703, 'Clione', 'n.', 'A genus of naked pteropods. One species (Clione\n   papilonacea), abundant in the Arctic Ocean, constitutes a part of the\n   food of the Greenland whale. It is sometimes incorrectly called Clio.'),
(14704, 'Clipped', 'imp. & p. p.', 'of Clip'),
(14705, 'Clipping', 'p. pr. & vb. n.', 'of Clip'),
(14706, 'Clipper', 'n.', 'One who clips; specifically, one who clips off the edges\n   of coin.'),
(14707, 'Clipper', 'n.', 'A machine for clipping hair, esp. the hair of horses.'),
(14708, 'Clipper', 'n.', 'A vessel with a sharp bow, built and rigged for fast\n   sailing.'),
(14709, 'Clipping', 'n.', 'The act of embracing.'),
(14710, 'Clipping', 'n.', 'The act of cutting off, curtailing, or diminishing; the\n   practice of clipping the edges of coins.'),
(14711, 'Clipping', 'n.', 'That which is clipped off or out of something; a piece\n   separated by clipping; as, newspaper clippings.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(14712, 'Clique', 'v. i.', 'A narrow circle of persons associated by common\n   interests or for the accomplishment of a common purpose; -- generally\n   used in a bad sense.'),
(14713, 'Clique', 'v. i.', 'To To associate together in a clannish way; to act with\n   others secretly to gain a desired end; to plot; -- used with together.'),
(14714, 'Cliquish', 'a.', 'Of or pertaining to a clique; disposed to from cliques;\n   exclusive in spirit.'),
(14715, 'Cliquism', 'n.', 'The tendency to associate in cliques; the spirit of\n   cliques.'),
(14716, 'Clitoris', 'n.', 'A small organ at the upper part of the vulva, homologous\n   to the penis in the male.'),
(14717, 'Clivers', 'n.', 'See Cleavers.'),
(14718, 'Clivity', 'n.', 'Inclination; ascent or descent; a gradient.'),
(14719, 'Cloacae', 'pl. ', 'of Cloaca'),
(14720, 'Cloaca', 'n.', 'A sewer; as, the Cloaca Maxima of Rome.'),
(14721, 'Cloaca', 'n.', 'A privy.'),
(14722, 'Cloaca', 'n.', 'The common chamber into which the intestinal, urinary, and\n   generative canals discharge in birds, reptiles, amphibians, and many\n   fishes.'),
(14723, 'Cloacal', 'a.', 'Of or pertaining to a cloaca.'),
(14724, 'Cloak', 'n.', 'A loose outer garment, extending from the neck downwards,\n   and commonly without sleeves. It is longer than a cape, and is worn\n   both by men and by women.'),
(14725, 'Cloak', 'n.', 'That which conceals; a disguise or pretext; an excuse; a\n   fair pretense; a mask; a cover.'),
(14726, 'Cloaked', 'imp. & p. p.', 'of Cloak'),
(14727, 'Cloaking', 'p. pr. & vb. n.', 'of Cloak'),
(14728, 'Cloak', 'v. t.', 'To cover with, or as with, a cloak; hence, to hide or\n   conceal.'),
(14729, 'Cloaking', 'n.', 'The act of covering with a cloak; the act of concealing\n   anything.'),
(14730, 'Cloaking', 'n.', 'The material of which of which cloaks are made.'),
(14731, 'Clock', 'n.', 'A machine for measuring time, indicating the hour and other\n   divisions by means of hands moving on a dial plate. Its works are moved\n   by a weight or a spring, and it is often so constructed as to tell the\n   hour by the stroke of a hammer on a bell. It is not adapted, like the\n   watch, to be carried on the person.'),
(14732, 'Clock', 'n.', 'A watch, esp. one that strikes.'),
(14733, 'Clock', 'n.', 'The striking of a clock.'),
(14734, 'Clock', 'n.', 'A figure or figured work on the ankle or side of a stocking.'),
(14735, 'Clock', 'v. t.', 'To ornament with figured work, as the side of a stocking.'),
(14736, 'Clock', 'v. t. & i.', 'To call, as a hen. See Cluck.'),
(14737, 'Clock', 'n.', 'A large beetle, esp. the European dung beetle (Scarabaeus\n   stercorarius).'),
(14738, 'Cloddish', 'a.', 'Resembling clods; gross; low; stupid; boorish.'),
(14739, 'Cloddy', 'a.', 'Consisting of clods; full of clods.'),
(14740, 'Clodpate', 'n.', 'A blockhead; a dolt.'),
(14741, 'Clodpoll', 'n.', 'A stupid fellow; a dolt.'),
(14742, 'Cloff', 'n.', 'Formerly an allowance of two pounds in every three hundred\n   weight after the tare and tret are subtracted; now used only in a\n   general sense, of small deductions from the original weight.'),
(14743, 'Clogged', 'imp. & p. p.', 'of Clog'),
(14744, 'Clogging', 'p. pr. & vb. n.', 'of Clog'),
(14745, 'Clogging', 'n.', 'Anything which clogs.'),
(14746, 'Cloggy', 'a.', 'Clogging, or having power to clog.'),
(14747, 'Cloister', 'v. t.', 'An inclosed place.'),
(14748, 'Cloister', 'v. t.', 'A covered passage or ambulatory on one side of a\n   court;'),
(14749, 'Cloister', 'v. t.', 'the series of such passages on the different sides of\n   any court, esp. that of a monastery or a college.'),
(14750, 'Cloister', 'v. t.', 'A monastic establishment; a place for retirement from\n   the world for religious duties.'),
(14751, 'Cloister', 'v. t.', 'To confine in, or as in, a cloister; to seclude from\n   the world; to immure.'),
(14752, 'Cloke', 'n. & v.', 'See Cloak.'),
(14753, 'Clomb', '', 'Alt. of Clomben'),
(14754, 'Clomben', '', 'imp. & p. p. of Climb (for climbed).'),
(14755, 'Clomp', 'n.', 'See Clamp.'),
(14756, 'Clong', '', 'imp. of Cling.'),
(14757, 'Clonic', 'a.', 'Having an irregular, convulsive motion.'),
(14758, 'Cloom', 'v. t.', 'To close with glutinous matter.'),
(14759, 'Cloop', 'n.', 'The sound made when a cork is forcibly drawn from a bottle.'),
(14760, 'Closed', 'imp. & p. p.', 'of Close'),
(14761, 'Closing', 'p. pr. & vb. n.', 'of Close'),
(14762, 'Close', 'n.', 'To stop, or fill up, as an opening; to shut; as, to close\n   the eyes; to close a door.'),
(14763, 'Close', 'n.', 'To bring together the parts of; to consolidate; as, to close\n   the ranks of an army; -- often used with up.'),
(14764, 'Close', 'n.', 'To bring to an end or period; to conclude; to complete; to\n   finish; to end; to consummate; as, to close a bargain; to close a\n   course of instruction.'),
(14765, 'Close', 'n.', 'To come or gather around; to inclose; to encompass; to\n   confine.'),
(14766, 'Close', 'v. i.', 'To come together; to unite or coalesce, as the parts of a\n   wound, or parts separated.'),
(14767, 'Close', 'v. i.', 'To end, terminate, or come to a period; as, the debate\n   closed at six o\'clock.'),
(14768, 'Close', 'v. i.', 'To grapple; to engage in hand-to-hand fight.'),
(14769, 'Close', 'n.', 'The manner of shutting; the union of parts; junction.'),
(14770, 'Close', 'n.', 'Conclusion; cessation; ending; end.'),
(14771, 'Close', 'n.', 'A grapple in wrestling.'),
(14772, 'Close', 'n.', 'The conclusion of a strain of music; cadence.'),
(14773, 'Close', 'n.', 'A double bar marking the end.'),
(14774, 'Close', 'v. t.', 'An inclosed place; especially, a small field or piece of\n   land surrounded by a wall, hedge, or fence of any kind; --\n   specifically, the precinct of a cathedral or abbey.'),
(14775, 'Close', 'v. t.', 'A narrow passage leading from a street to a court, and\n   the houses within.'),
(14776, 'Close', 'v. t.', 'The interest which one may have in a piece of ground,\n   even though it is not inclosed.'),
(14777, 'Close', 'v. t.', 'Shut fast; closed; tight; as, a close box.'),
(14778, 'Close', 'v. t.', 'Narrow; confined; as, a close alley; close quarters.'),
(14779, 'Close', 'v. t.', 'Oppressive; without motion or ventilation; causing a\n   feeling of lassitude; -- said of the air, weather, etc.'),
(14780, 'Close', 'v. t.', 'Strictly confined; carefully quarded; as, a close\n   prisoner.'),
(14781, 'Close', 'v. t.', 'Out of the way observation; secluded; secret; hidden.'),
(14782, 'Close', 'v. t.', 'Disposed to keep secrets; secretive; reticent.'),
(14783, 'Close', 'v. t.', 'Having the parts near each other; dense; solid; compact;\n   as applied to bodies; viscous; tenacious; not volatile, as applied to\n   liquids.'),
(14784, 'Close', 'v. t.', 'Concise; to the point; as, close reasoning.'),
(14785, 'Close', 'v. t.', 'Adjoining; near; either in space; time, or thought; --\n   often followed by to.'),
(14786, 'Close', 'v. t.', 'Short; as, to cut grass or hair close.'),
(14787, 'Close', 'v. t.', 'Intimate; familiar; confidential.'),
(14788, 'Close', 'v. t.', 'Nearly equal; almost evenly balanced; as, a close vote.'),
(14789, 'Close', 'v. t.', 'Difficult to obtain; as, money is close.'),
(14790, 'Close', 'v. t.', 'Parsimonious; stingy.'),
(14791, 'Close', 'v. t.', 'Adhering strictly to a standard or original; exact;\n   strict; as, a close translation.'),
(14792, 'Close', 'v. t.', 'Accurate; careful; precise; also, attentive; undeviating;\n   strict; not wandering; as, a close observer.'),
(14793, 'Close', 'v. t.', 'Uttered with a relatively contracted opening of the\n   mouth, as certain sounds of e and o in French, Italian, and German; --\n   opposed to open.'),
(14794, 'Close', 'adv.', 'In a close manner.'),
(14795, 'Close', 'adv.', 'Secretly; darkly.'),
(14796, 'Closely', 'adv.', 'In a close manner.'),
(14797, 'Closely', 'adv.', 'Secretly; privately.'),
(14798, 'Closen', 'v. t.', 'To make close.'),
(14799, 'Closer', 'n.', 'One who, or that which, closes; specifically, a boot\n   closer. See under Boot.'),
(14800, 'Closer', 'n.', 'A finisher; that which finishes or terminates.'),
(14801, 'Closer', 'n.', 'The last stone in a horizontal course, if of a less size\n   than the others, or a piece of brick finishing a course.'),
(14802, 'Closet', 'n.', 'A small room or apartment for retirement; a room for\n   privacy.'),
(14803, 'Closet', 'n.', 'A small apartment, or recess in the side of a room, for\n   household utensils, clothing, etc.'),
(14804, 'Closet', 'v. t.', 'To shut up in, or as in, a closet; to conceal.'),
(14805, 'Closet', 'v. t.', 'To make into a closet for a secret interview.'),
(14806, 'Closh', 'n.', 'A disease in the feet of cattle; laminitis.'),
(14807, 'Closh', 'n.', 'The game of ninepins.'),
(14808, 'Closure', 'v. t.', 'The act of shutting; a closing; as, the closure of a\n   chink.'),
(14809, 'Closure', 'v. t.', 'That which closes or shuts; that by which separate\n   parts are fastened or closed.'),
(14810, 'Closure', 'v. t.', 'That which incloses or confines; an inclosure.'),
(14811, 'Closure', 'v. t.', 'A conclusion; an end.'),
(14812, 'Closure', 'v. t.', 'A method of putting an end to debate and securing an\n   immediate vote upon a measure before a legislative body. It is similar\n   in effect to the previous question. It was first introduced into the\n   British House of Commons in 1882. The French word cloture was\n   originally applied to this proceeding.'),
(14813, 'Clotted', 'imp. & p. p.', 'of Clot'),
(14814, 'Clotting', 'p. pr. & vb. n.', 'of Clot'),
(14815, 'Clotbur', 'n.', 'The burdock.'),
(14816, 'Clotbur', 'n.', 'Same as Cocklebur.'),
(14817, 'Clote', 'n.', 'The common burdock; the clotbur.'),
(14818, 'Cloths', 'pl. ', 'of Cloth'),
(14819, 'Clothes', 'pl. ', 'of Cloth'),
(14820, 'Cloth', 'n.', 'A fabric made of fibrous material (or sometimes of wire, as\n   in wire cloth); commonly, a woven fabric of cotton, woolen, or linen,\n   adapted to be made into garments; specifically, woolen fabrics, as\n   distinguished from all others.'),
(14821, 'Cloth', 'n.', 'The dress; raiment. [Obs.] See Clothes.'),
(14822, 'Cloth', 'n.', 'The distinctive dress of any profession, especially of the\n   clergy; hence, the clerical profession.'),
(14823, 'Clothed', 'imp. & p. p.', 'of Clothe'),
(14824, 'Clothing', 'p. pr. & vb. n.', 'of Clothe'),
(14825, 'Clothe', 'v. t.', 'To put garments on; to cover with clothing; to dress.'),
(14826, 'Clothe', 'v. t.', 'To provide with clothes; as, to feed and clothe a\n   family; to clothe one\'s self extravagantly.'),
(14827, 'Clothe', 'v. t.', 'Fig.: To cover or invest, as with a garment; as, to\n   clothe one with authority or power.'),
(14828, 'Clothe', 'v. i.', 'To wear clothes.'),
(14829, 'Clothes', 'n. pl.', 'Covering for the human body; dress; vestments;\n   vesture; -- a general term for whatever covering is worn, or is made to\n   be worn, for decency or comfort.'),
(14830, 'Clothes', 'n. pl.', 'The covering of a bed; bedclothes.'),
(14831, 'Clothier', 'n.', 'One who makes cloths; one who dresses or fulls cloth.'),
(14832, 'Clothier', 'n.', 'One who sells cloth or clothes, or who makes and sells\n   clothes.'),
(14833, 'Clothing', 'n.', 'Garments in general; clothes; dress; raiment; covering.'),
(14834, 'Clothing', 'n.', 'The art of process of making cloth.'),
(14835, 'Clothing', 'n.', 'A covering of non-conducting material on the outside of a\n   boiler, or steam chamber, to prevent radiation of heat.'),
(14836, 'Clothing', 'n.', 'See Card clothing, under 3d Card.'),
(14837, 'Clothred', 'p. p.', 'Clottered.'),
(14838, 'Clotpoll', 'n.', 'See Clodpoll.'),
(14839, 'Clotted', 'a.', 'Composed of clots or clods; having the quality or form of\n   a clot; sticky; slimy; foul.'),
(14840, 'Clotter', 'v. i.', 'To concrete into lumps; to clot.'),
(14841, 'Clotty', 'n.', 'Full of clots, or clods.'),
(14842, 'Cloture', 'n.', 'See Closure, 5.'),
(14843, 'Clotweed', 'n.', 'Cocklebur.'),
(14844, 'Cloud', 'n.', 'A collection of visible vapor, or watery particles,\n   suspended in the upper atmosphere.'),
(14845, 'Cloud', 'n.', 'A mass or volume of smoke, or flying dust, resembling vapor.'),
(14846, 'Cloud', 'n.', 'A dark vein or spot on a lighter material, as in marble;\n   hence, a blemish or defect; as, a cloud upon one\'s reputation; a cloud\n   on a title.'),
(14847, 'Cloud', 'n.', 'That which has a dark, lowering, or threatening aspect; that\n   which temporarily overshadows, obscures, or depresses; as, a cloud of\n   sorrow; a cloud of war; a cloud upon the intellect.'),
(14848, 'Cloud', 'n.', 'A great crowd or multitude; a vast collection.'),
(14849, 'Cloud', 'n.', 'A large, loosely-knitted scarf, worn by women about the\n   head.'),
(14850, 'Clouded', 'imp. & p. p.', 'of Cloud'),
(14851, 'Clouding', 'p. pr. & vb. n.', 'of Cloud'),
(14852, 'Cloud', 'v. t.', 'To overspread or hide with a cloud or clouds; as, the sky\n   is clouded.'),
(14853, 'Cloud', 'v. t.', 'To darken or obscure, as if by hiding or enveloping with\n   a cloud; hence, to render gloomy or sullen.'),
(14854, 'Cloud', 'v. t.', 'To blacken; to sully; to stain; to tarnish; to damage; --\n   esp. used of reputation or character.'),
(14855, 'Cloud', 'v. t.', 'To mark with, or darken in, veins or sports; to variegate\n   with colors; as, to cloud yarn.'),
(14856, 'Cloud', 'v. i.', 'To grow cloudy; to become obscure with clouds; -- often\n   used with up.'),
(14857, 'Cloudage', 'n.', 'Mass of clouds; cloudiness.'),
(14858, 'Cloudily', 'adv.', 'In a cloudy manner; darkly; obscurely.'),
(14859, 'Clouding', 'n.', 'A mottled appearance given to ribbons and silks in the\n   process of dyeing.'),
(14860, 'Clouding', 'n.', 'A diversity of colors in yarn, recurring at regular\n   intervals.'),
(14861, 'Cloudlet', 'n.', 'A little cloud.'),
(14862, 'Cloudy', 'n.', 'Overcast or obscured with clouds; clouded; as, a cloudy\n   sky.'),
(14863, 'Cloudy', 'n.', 'Consisting of a cloud or clouds.'),
(14864, 'Cloudy', 'n.', 'Indicating gloom, anxiety, sullenness, or ill-nature; not\n   open or cheerful.'),
(14865, 'Cloudy', 'n.', 'Confused; indistinct; obscure; dark.'),
(14866, 'Cloudy', 'n.', 'Lacking clearness, brightness, or luster.'),
(14867, 'Cloudy', 'n.', 'Marked with veins or sports of dark or various hues, as\n   marble.'),
(14868, 'Clough', 'n.', 'A cleft in a hill; a ravine; a narrow valley.'),
(14869, 'Clough', 'n.', 'A sluice used in returning water to a channel after\n   depositing its sediment on the flooded land.'),
(14870, 'Clough', 'n.', 'An allowance in weighing. See Cloff.'),
(14871, 'Clout', 'n.', 'A cloth; a piece of cloth or leather; a patch; a rag.'),
(14872, 'Clout', 'n.', 'A swadding cloth.'),
(14873, 'Clout', 'n.', 'A piece; a fragment.'),
(14874, 'Clout', 'n.', 'The center of the butt at which archers shoot; -- probably\n   once a piece of white cloth or a nail head.'),
(14875, 'Clout', 'n.', 'An iron plate on an axletree or other wood to keep it from\n   wearing; a washer.'),
(14876, 'Clout', 'n.', 'A blow with the hand.'),
(14877, 'Clouted', 'imp. & p. p.', 'of Clout'),
(14878, 'Clouting', 'p. pr. & vb. n.', 'of Clout'),
(14879, 'Clout', 'n.', 'To cover with cloth, leather, or other material; to bandage;\n   patch, or mend, with a clout.'),
(14880, 'Clout', 'n.', 'To join or patch clumsily.'),
(14881, 'Clout', 'n.', 'To quard with an iron plate, as an axletree.'),
(14882, 'Clout', 'n.', 'To give a blow to; to strike.'),
(14883, 'Clout', 'n.', 'To stud with nails, as a timber, or a boot sole.'),
(14884, 'Clove', 'imp.', 'Cleft.'),
(14885, 'Clove', 'v. t.', 'A cleft; a gap; a ravine; -- rarely used except as part\n   of a proper name; as, Kaaterskill Clove; Stone Clove.'),
(14886, 'Clove', 'n.', 'A very pungent aromatic spice, the unexpanded flower bud of\n   the clove tree (Eugenia, / Caryophullus, aromatica), a native of the\n   Molucca Isles.'),
(14887, 'Clove', 'n.', 'One of the small bulbs developed in the axils of the scales\n   of a large bulb, as in the case of garlic.'),
(14888, 'Clove', 'n.', 'A weight. A clove of cheese is about eight pounds, of wool,\n   about seven pounds.'),
(14889, 'Cloven', 'p. p. & a.', 'from Cleave, v. t.'),
(14890, 'Clover', 'n.', 'A plant of different species of the genus Trifolium; as the\n   common red clover, T. pratense, the white, T. repens, and the hare\'s\n   foot, T. arvense.'),
(14891, 'Clovered', 'a.', 'Covered with growing clover.'),
(14892, 'Clown', 'n.', 'A man of coarse nature and manners; an awkward fellow; an\n   ill-bred person; a boor.'),
(14893, 'Clown', 'n.', 'One who works upon the soil; a rustic; a churl.'),
(14894, 'Clown', 'n.', 'The fool or buffoon in a play, circus, etc.'),
(14895, 'Clown', 'v. i.', 'To act as a clown; -- with it.'),
(14896, 'Clownage', 'n.', 'Behavior or manners of a clown; clownery.'),
(14897, 'Clownery', 'n.', 'Clownishness.'),
(14898, 'Clownish', 'a.', 'Of or resembling a clown, or characteristic of a clown;\n   ungainly; awkward.'),
(14899, 'Cloyed', 'imp. & p. p.', 'of Cloy'),
(14900, 'Cloying', 'p. pr. & vb. n.', 'of Cloy'),
(14901, 'Cloyless', 'a.', 'That does not cloy.'),
(14902, 'Cloyment', 'n.', 'Satiety.'),
(14903, 'Clubbed', 'imp. & p. p.', 'of Club'),
(14904, 'Clubbing', 'p. pr. & vb. n.', 'of Club'),
(14905, 'Clubbed', 'a.', 'Shaped like a club; grasped like, or used as, a club.'),
(14906, 'Clubber', 'n.', 'One who clubs.'),
(14907, 'Clubber', 'n.', 'A member of a club.'),
(14908, 'Clubbish', 'a.', 'Rude; clownish.'),
(14909, 'Clubbish', 'a.', 'Disposed to club together; as, a clubbish set.'),
(14910, 'Clubbist', 'n.', 'A member of a club; a frequenter of clubs.'),
(14911, 'Clubfist', 'n.', 'A large, heavy fist.'),
(14912, 'Clubfist', 'n.', 'A coarse, brutal fellow.'),
(14913, 'Clubfoot', 'n.', 'A short, variously distorted foot; also, the deformity,\n   usually congenital, which such a foot exhibits; talipes.'),
(14914, 'Clubhand', 'n.', 'A short, distorted hand; also, the deformity of having\n   such a hand.'),
(14915, 'Clubhaul', 'v. t.', 'To put on the other tack by dropping the lee anchor as\n   soon as the wind is out of the sails (which brings the vessel\'s head to\n   the wind), and by cutting the cable as soon as she pays off on the\n   other tack. Clubhauling is attempted only in an exigency.'),
(14916, 'Clubroom', 'n.', 'The apartment in which a club meets.'),
(14917, 'Clucked', 'imp. & p. p.', 'of Cluck'),
(14918, 'Clucking', 'p pr. & vb. n.', 'of Cluck'),
(14919, 'Cluck', 'v. i.', 'To make the noise, or utter the call, of a brooding hen.'),
(14920, 'Cluck', 'v. t.', 'To call together, or call to follow, as a hen does her\n   chickens.'),
(14921, 'Cluck', 'n.', 'The call of a hen to her chickens.'),
(14922, 'Cluck', 'n.', 'A click. See 3d Click, 2.'),
(14923, 'Clucking', 'n.', 'The noise or call of a brooding hen.'),
(14924, 'Clumber', 'n.', 'A kind of field spaniel, with short legs and stout body,\n   which, unlike other spaniels, hunts silently.'),
(14925, 'Clump', 'n.', 'An unshaped piece or mass of wood or other substance.'),
(14926, 'Clump', 'n.', 'A cluster; a group; a thicket.'),
(14927, 'Clump', 'n.', 'The compressed clay of coal strata.'),
(14928, 'Clump', 'v. t.', 'To arrange in a clump or clumps; to cluster; to group.'),
(14929, 'Clump', 'v. i.', 'To tread clumsily; to clamp.'),
(14930, 'Clumper', 'n.', 'To form into clumps or masses.'),
(14931, 'Clumps', 'n.', 'A game in which questions are asked for the purpose of\n   enabling the questioners to discover a word or thing previously\n   selected by two persons who answer the questions; -- so called because\n   the players take sides in two \"clumps\" or groups, the \"clump\" which\n   guesses the word winning the game.'),
(14932, 'Clumpy', 'n.', 'Composed of clumps; massive; shapeless.'),
(14933, 'Clumsily', 'adv.', 'In a clumsy manner; awkwardly; as, to walk clumsily.'),
