(15213, 'Coerced', 'imp. & p. p.', 'of Coerce'),
(15214, 'Coercing', 'p. pr. & vb. n.', 'of Coerce'),
(15215, 'Coerce', 'v. t.', 'To restrain by force, especially by law or authority; to\n   repress; to curb.'),
(15216, 'Coerce', 'v. t.', 'To compel or constrain to any action; as, to coerce a\n   man to vote for a certain candidate.'),
(15217, 'Coerce', 'v. t.', 'To compel or enforce; as, to coerce obedience.'),
(15218, 'Coercion', 'n.', 'The act or process of coercing.'),
(15219, 'Coercion', 'n.', 'The application to another of either physical or moral\n   force. When the force is physical, and cannot be resisted, then the act\n   produced by it is a nullity, so far as concerns the party coerced. When\n   the force is moral, then the act, though voidable, is imputable to the\n   party doing it, unless he be so paralyzed by terror as to act\n   convulsively. At the same time coercion is not negatived by the fact of\n   submission under force. \"Coactus volui\" (I consented under compulsion)\n   is the condition of mind which, when there is volition forced by\n   coercion, annuls the result of such coercion.'),
(15220, 'Coercive', 'a.', 'Serving or intended to coerce; having power to constrain.'),
(15221, 'Coestate', 'n.', 'Joint estate.'),
(15222, 'Coeval', 'n.', 'Of the same age; existing during the same period of time,\n   especially time long and remote; -- usually followed by with.'),
(15223, 'Coeval', 'n.', 'One of the same age; a contemporary.'),
(15224, 'Coevous', 'a.', 'Coeval'),
(15225, 'Coexist', 'v. i.', 'To exist at the same time; -- sometimes followed by\n   with.'),
(15226, 'Coextend', 'v. t.', 'To extend through the same space or time with another;\n   to extend to the same degree.'),
(15227, 'Coffee', 'n.', 'The \"beans\" or \"berries\" (pyrenes) obtained from the drupes\n   of a small evergreen tree of the genus Coffea, growing in Abyssinia,\n   Arabia, Persia, and other warm regions of Asia and Africa, and also in\n   tropical America.'),
(15228, 'Coffee', 'n.', 'The coffee tree.'),
(15229, 'Coffee', 'n.', 'The beverage made from the roasted and ground berry.'),
(15230, 'Coffer', 'n.', 'A casket, chest, or trunk; especially, one used for keeping\n   money or other valuables.'),
(15231, 'Coffer', 'n.', 'Fig.: Treasure or funds; -- usually in the plural.'),
(15232, 'Coffer', 'n.', 'A panel deeply recessed in the ceiling of a vault, dome, or\n   portico; a caisson.'),
(15233, 'Coffer', 'n.', 'A trench dug in the bottom of a dry moat, and extending\n   across it, to enable the besieged to defend it by a raking fire.'),
(15234, 'Coffer', 'n.', 'The chamber of a canal lock; also, a caisson or a\n   cofferdam.'),
(15235, 'Coffer', 'v. t.', 'To put into a coffer.'),
(15236, 'Coffer', 'v. t.', 'To secure from leaking, as a shaft, by ramming clay\n   behind the masonry or timbering.'),
(15237, 'Coffer', 'v. t.', 'To form with or in a coffer or coffers; to furnish with\n   a coffer or coffers.'),
(15238, 'Cofferer', 'n.', 'One who keeps treasures in a coffer.'),
(15239, 'Coffin', 'n.', 'The case in which a dead human body is inclosed for burial.'),
(15240, 'Coffin', 'n.', 'A basket.'),
(15241, 'Coffin', 'n.', 'A casing or crust, or a mold, of pastry, as for a pie.'),
