(15243, 'Coffin', 'n.', 'The hollow crust or hoof of a horse\'s foot, below the\n   coronet, in which is the coffin bone.'),
(15244, 'Coffined', 'imp. & p. p.', 'of Coffin'),
(15245, 'Coffin', 'v. t.', 'To inclose in, or as in, a coffin.'),
(15246, 'Coffle', 'n.', 'A gang of negro slaves being driven to market.'),
(15247, 'Cogged', 'imp. & p. p.', 'of Cog'),
(15248, 'Cogging', 'p. pr. & vb. n.', 'of Cog'),
(15249, 'Cogency', 'n.', 'The quality of being cogent; power of compelling\n   conviction; conclusiveness; force.'),
(15250, 'Cogenial', 'a.', 'Congenial.'),
(15251, 'Cogent', 'p. a.', 'Compelling, in a physical sense; powerful.'),
