(15255, 'Coggery', 'n.', 'Trick; deception.'),
(15256, 'Coggle', 'n.', 'A small fishing boat.'),
(15257, 'Coggle', 'n.', 'A cobblestone.'),
(15258, 'Cogitate', 'v. i.', 'To engage in continuous thought; to think.'),
(15259, 'Cogitate', 'v. t.', 'To think over; to plan.'),
(15260, 'Cogman', 'n.', 'A dealer in cogware or coarse cloth.'),
(15261, 'Cognac', 'n.', 'A kind of French brandy, so called from the town of Cognac.'),
(15262, 'Cognate', 'a.', 'Allied by blood; kindred by birth; specifically (Law),\n   related on the mother\'s side.'),
(15263, 'Cognate', 'a.', 'Of the same or a similar nature; of the same family;\n   proceeding from the same stock or root; allied; kindred; as, a cognate\n   language.'),
(15264, 'Cognate', 'n.', 'One who is related to another on the female side.'),
(15265, 'Cognate', 'n.', 'One of a number of things allied in origin or nature; as,\n   certain letters are cognates.'),
(15266, 'Cognati', 'n. pl.', 'Relatives by the mother\'s side.'),
(15267, 'Cognatus', 'n.', 'A person connected through cognation.'),
(15268, 'Cognisor', 'n.', 'Alt. of Cognisee'),
(15269, 'Cognisee', 'n.', 'See Cognizor, Cognizee.'),
(15270, 'Cognize', 'v. t.', 'To know or perceive; to recognize.'),
