INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(15277, 'Cogware', 'n.', 'A coarse, narrow cloth, like frieze, used by the lower\n   classes in the sixteenth century.'),
(15278, 'Cogwheel', 'n.', 'A wheel with cogs or teeth; a gear wheel. See Illust. of\n   Gearing.'),
(15279, 'Cohabit', 'v.', 'To inhabit or reside in company, or in the same place or\n   country.'),
(15280, 'Cohabit', 'v.', 'To dwell or live together as husband and wife.'),
(15281, 'Coheir', 'n.', 'A joint heir; one of two or more heirs; one of several\n   entitled to an inheritance.'),
(15282, 'Coherald', 'n.', 'A joint herald.'),
(15283, 'Cohered', 'imp. & p. p.', 'of Cohere'),
(15284, 'Cohering', 'p. pr. & vb. n.', 'of Cohere'),
(15285, 'Cohere', 'a.', 'To stick together; to cleave; to be united; to hold fast,\n   as parts of the same mass.'),
(15286, 'Cohere', 'a.', 'To be united or connected together in subordination to one\n   purpose; to follow naturally and logically, as the parts of a\n   discourse, or as arguments in a train of reasoning; to be logically\n   consistent.'),
(15287, 'Cohere', 'a.', 'To suit; to agree; to fit.'),
(15288, 'Coherent', 'a.', 'Sticking together; cleaving; as the parts of bodies;\n   solid or fluid.'),
(15289, 'Coherent', 'a.', 'Composed of mutually dependent parts; making a logical\n   whole; consistent; as, a coherent plan, argument, or discourse.'),
(15290, 'Coherent', 'a.', 'Logically consistent; -- applied to persons; as, a\n   coherent thinker.'),
(15291, 'Coherent', 'a.', 'Suitable or suited; adapted; accordant.'),
(15292, 'Cohesion', 'n.', 'The act or state of sticking together; close union.'),
(15293, 'Cohesion', 'n.', 'That from of attraction by which the particles of a body\n   are united throughout the mass, whether like or unlike; --\n   distinguished from adhesion, which unites bodies by their adjacent\n   surfaces.'),
(15294, 'Cohesion', 'n.', 'Logical agreement and dependence; as, the cohesion of\n   ideas.'),
(15295, 'Cohesive', 'a.', 'Holding the particles of a homogeneous body together; as,\n   cohesive attraction; producing cohesion; as, a cohesive force.'),
(15296, 'Cohesive', 'a.', 'Cohering, or sticking together, as in a mass; capable of\n   cohering; tending to cohere; as, cohesive clay.'),
(15297, 'Cohibit', 'v. t.', 'To restrain.'),
(15298, 'Cohobate', 'v. t.', 'To repeat the distillation of, pouring the liquor back\n   upon the matter remaining in the vessel.'),
(15299, 'Cohorn', 'n.', 'See Coehorn.'),
(15300, 'Cohort', 'n.', 'A body of about five or six hundred soldiers; the tenth\n   part of a legion.'),
(15301, 'Cohort', 'n.', 'Any band or body of warriors.'),
