(15309, 'Coiled', 'imp. & p. p.', 'of Coil'),
(15310, 'Coiling', 'p. pr. & vb. n.', 'of Coil'),
(15311, 'Coilon', 'n.', 'A testicle.'),
(15312, 'Coined', 'imp. & p. p.', 'of Coin'),
(15313, 'Coining', 'p. pr. & vb. n.', 'of Coin'),
(15314, 'Coinage', 'v. t.', 'The act or process of converting metal into money.'),
(15315, 'Coinage', 'v. t.', 'Coins; the aggregate coin of a time or place.'),
