(15318, 'Coincide', 'n.', 'To occupy the same place in space, as two equal\n   triangles, when placed one on the other.'),
(15319, 'Coincide', 'n.', 'To occur at the same time; to be contemporaneous; as, the\n   fall of Granada coincided with the discovery of America.'),
