(15341, 'Coleslaw', 'n.', 'A salad made of sliced cabbage.'),
(15342, 'Colet', '', 'Alt. of Collet'),
(15343, 'Collet', '', 'An inferior church servant. [Obs.] See Acolyte.'),
(15344, 'Coletit', 'n.', 'Alt. of Coaltit'),
(15345, 'Coaltit', 'n.', 'A small European titmouse (Parus ater), so named from its\n   black color; -- called also coalmouse and colemouse.'),
(15346, 'Coleus', 'n.', 'A plant of several species of the Mint family, cultivated\n   for its bright-colored or variegated leaves.'),
(15347, 'Colewort', 'n.', 'A variety of cabbage in which the leaves never form a\n   compact head.'),
(15348, 'Colewort', 'n.', 'Any white cabbage before the head has become firm.'),
(15349, 'Colfox', 'n.', 'A crafty fox.'),
(15350, 'Colic', 'n.', 'A severe paroxysmal pain in the abdomen, due to spasm,\n   obstruction, or distention of some one of the hollow viscera.'),
(15351, 'Colic', 'a.', 'Of or pertaining to colic; affecting the bowels.'),
(15352, 'Colic', 'a.', 'Of or pertaining to the colon; as, the colic arteries.'),
(15353, 'Colical', 'a.', 'Of, pertaining to, or of the nature of, colic.'),
(15354, 'Colicky', 'a.', 'Pertaining to, or troubled with, colic; as, a colicky\n   disorder.'),
(15355, 'Colin', 'n.', 'The American quail or bobwhite. The name is also applied to\n   other related species. See Bobwhite.'),
(15356, 'Coliseum', 'n.', 'The amphitheater of Vespasian at Rome, the largest in the\n   world.'),
(15357, 'Colitis', 'n.', 'An inflammation of the large intestine, esp. of its mucous\n   membrane; colonitis.'),
(15358, 'Collagen', 'n.', 'The chemical basis of ordinary connective tissue, as of\n   tendons or sinews and of bone. On being boiled in water it becomes\n   gelatin or glue.'),
(15359, 'Collapse', 'v. i.', 'To fall together suddenly, as the sides of a hollow\n   vessel; to close by falling or shrinking together; to have the sides or\n   parts of (a thing) fall in together, or be crushed in together; as, a\n   flue in the boiler of a steam engine sometimes collapses.'),
(15360, 'Collapse', 'v. i.', 'To fail suddenly and completely, like something hollow\n   when subject to too much pressure; to undergo a collapse; as,\n   Maximilian\'s government collapsed soon after the French army left\n   Mexico; many financial projects collapse after attaining some success\n   and importance.'),
(15361, 'Collapse', 'n.', 'A falling together suddenly, as of the sides of a hollow\n   vessel.'),
(15362, 'Collapse', 'n.', 'A sudden and complete failure; an utter failure of any\n   kind; a breakdown.'),
(15363, 'Collapse', 'n.', 'Extreme depression or sudden failing of all the vital\n   powers, as the result of disease, injury, or nervous disturbance.'),
(15364, 'Collar', 'n.', 'Something worn round the neck, whether for use, ornament,\n   restraint, or identification; as, the collar of a coat; a lady\'s\n   collar; the collar of a dog.'),
(15365, 'Collar', 'n.', 'A ring or cincture.'),
(15366, 'Collar', 'n.', 'A collar beam.'),
(15367, 'Collar', 'n.', 'The neck or line of junction between the root of a plant\n   and its stem.'),
(15368, 'Collar', 'n.', 'An ornament worn round the neck by knights, having on it\n   devices to designate their rank or order.'),
(15369, 'Collar', 'n.', 'A ringlike part of a mollusk in connection with esophagus.'),
(15370, 'Collar', 'n.', 'A colored ring round the neck of a bird or mammal.'),
(15371, 'Collar', 'n.', 'A ring or round flange upon, surrounding, or against an\n   object, and used for restraining motion within given limits, or for\n   holding something to its place, or for hiding an opening around an\n   object; as, a collar on a shaft, used to prevent endwise motion of the\n   shaft; a collar surrounding a stovepipe at the place where it enters a\n   wall. The flanges of a piston and the gland of a stuffing box are\n   sometimes called collars.'),
(15372, 'Collar', 'n.', 'An eye formed in the bight or bend of a shroud or stay to\n   go over the masthead; also, a rope to which certain parts of rigging,\n   as dead-eyes, are secured.'),
(15373, 'Collar', 'n.', 'A curb, or a horizontal timbering, around the mouth of a\n   shaft.'),
(15374, 'Collared', 'imp. & p. p.', 'of Collar'),
(15375, 'Collar', 'v. t.', 'To seize by the collar.'),
(15376, 'Collar', 'v. t.', 'To put a collar on.'),
(15377, 'Collards', 'n. pl.', 'Young cabbage, used as \"greens\"; esp. a kind\n   cultivated for that purpose; colewort.'),
(15378, 'Collared', 'a.', 'Wearing a collar.'),
(15379, 'Collared', 'a.', 'Wearing a collar; -- said of a man or beast used as a\n   bearing when a collar is represented as worn around the neck or loins.'),
(15380, 'Collared', 'a.', 'Rolled up and bound close with a string; as, collared\n   beef. See To collar beef, under Collar, v. t.'),
(15381, 'Collated', 'imp. & p. p.', 'of Collate'),
(15382, 'Collate', 'v. t.', 'To compare critically, as books or manuscripts, in\n   order to note the points of agreement or disagreement.'),
(15383, 'Collate', 'v. t.', 'To gather and place in order, as the sheets of a book\n   for binding.'),
(15384, 'Collate', 'v. t.', 'To present and institute in a benefice, when the person\n   presenting is both the patron and the ordinary; -- followed by to.'),
(15385, 'Collate', 'v. t.', 'To bestow or confer.'),
(15386, 'Collate', 'v. i.', 'To place in a benefice, when the person placing is both\n   the patron and the ordinary.'),
(15387, 'Collator', 'n.', 'One who collates manuscripts, books, etc.'),
(15388, 'Collator', 'n.', 'One who collates to a benefice.'),
(15389, 'Collator', 'n.', 'One who confers any benefit.'),
(15390, 'Collaud', 'v. t.', 'To join in praising.'),
(15391, 'Collect', 'v. t.', 'To gather into one body or place; to assemble or bring\n   together; to obtain by gathering.'),
(15392, 'Collect', 'v. t.', 'To demand and obtain payment of, as an account, or\n   other indebtedness; as, to collect taxes.'),
(15393, 'Collect', 'v. t.', 'To infer from observed facts; to conclude from\n   premises.'),
(15394, 'Collect', 'v. i.', 'To assemble together; as, the people collected in a\n   crowd; to accumulate; as, snow collects in banks.'),
(15395, 'Collect', 'v. i.', 'To infer; to conclude.'),
(15396, 'Collect', 'v. t.', 'A short, comprehensive prayer, adapted to a particular\n   day, occasion, or condition, and forming part of a liturgy.'),
(15397, 'College', 'n.', 'A collection, body, or society of persons engaged in\n   common pursuits, or having common duties and interests, and sometimes,\n   by charter, peculiar rights and privileges; as, a college of heralds; a\n   college of electors; a college of bishops.'),
(15398, 'College', 'n.', 'A society of scholars or friends of learning, incorporated\n   for study or instruction, esp. in the higher branches of knowledge; as,\n   the colleges of Oxford and Cambridge Universities, and many American\n   colleges.'),
(15399, 'College', 'n.', 'A building, or number of buildings, used by a college.'),
(15400, 'College', 'n.', 'Fig.: A community.'),
(15401, 'Collet', 'n.', 'A small collar or neckband.'),
(15402, 'Collet', 'n.', 'A small metal ring; a small collar fastened on an arbor;\n   as, the collet on the balance arbor of a watch; a small socket on a\n   stem, for holding a drill.'),
(15403, 'Collet', 'n.', 'The part of a ring containing the bezel in which the stone\n   is set.'),
(15404, 'Collet', 'n.', 'The flat table at the base of a brilliant. See Illust. of\n   Brilliant.'),
(15405, 'Colletic', 'a.', 'Agglutinant.'),
(15406, 'Colletic', 'n.', 'An agglutinant.'),
(15407, 'Colley', 'n.', 'See Collie.'),
(15408, 'Collide', 'v. i.', 'To strike or dash against each other; to come into\n   collision; to clash; as, the vessels collided; their interests\n   collided.'),
(15409, 'Collide', 'v. t.', 'To strike or dash against.'),
(15410, 'Collie', 'n.', 'The Scotch shepherd dog. There are two breeds, the\n   rough-haired and smooth-haired. It is remarkable for its intelligence,\n   displayed especially in caring for flocks.'),
(15411, 'Collied', 'p. & a.', 'Darkened. See Colly, v. t.'),
(15412, 'Collier', 'n.', 'One engaged in the business of digging mineral coal or\n   making charcoal, or in transporting or dealing in coal.'),
(15413, 'Collier', 'n.', 'A vessel employed in the coal trade.'),
