(15652, 'Common', 'v.', 'Given to habits of lewdness; prostitute.'),
(15653, 'Common', 'n.', 'The people; the community.'),
(15654, 'Common', 'n.', 'An inclosed or uninclosed tract of ground for pleasure, for\n   pasturage, etc., the use of which belongs to the public; or to a number\n   of persons.'),
(15655, 'Common', 'n.', 'The right of taking a profit in the land of another, in\n   common either with the owner or with other persons; -- so called from\n   the community of interest which arises between the claimant of the\n   right and the owner of the soil, or between the claimants and other\n   commoners entitled to the same right.'),
(15656, 'Common', 'v. i.', 'To converse together; to discourse; to confer.'),
(15657, 'Common', 'v. i.', 'To participate.'),
(15658, 'Common', 'v. i.', 'To have a joint right with others in common ground.'),
(15659, 'Common', 'v. i.', 'To board together; to eat at a table in common.'),
(15660, 'Commoner', 'n.', 'One of the common people; one having no rank of nobility.'),
(15661, 'Commoner', 'n.', 'A member of the House of Commons.'),
(15662, 'Commoner', 'n.', 'One who has a joint right in common ground.'),
(15663, 'Commoner', 'n.', 'One sharing with another in anything.'),
(15664, 'Commoner', 'n.', 'A student in the university of Oxford, Eng., who is not\n   dependent on any foundation for support, but pays all university\n   charges; - - at Cambridge called a pensioner.'),
(15665, 'Commoner', 'n.', 'A prostitute.'),
(15666, 'Commonly', 'adv.', 'Usually; generally; ordinarily; frequently; for the\n   most part; as, confirmed habits commonly continue through life.'),
(15667, 'Commonly', 'adv.', 'In common; familiarly.'),
(15668, 'Commons', 'n. pl.', 'The mass of the people, as distinguished from the\n   titled classes or nobility; the commonalty; the common people.'),
(15669, 'Commons', 'n. pl.', 'The House of Commons, or lower house of the British\n   Parliament, consisting of representatives elected by the qualified\n   voters of counties, boroughs, and universities.'),
(15670, 'Commons', 'n. pl.', 'Provisions; food; fare, -- as that provided at a\n   common table in colleges and universities.'),
(15671, 'Commons', 'n. pl.', 'A club or association for boarding at a common table,\n   as in a college, the members sharing the expenses equally; as, to board\n   in commons.'),
(15672, 'Commons', 'n. pl.', 'A common; public pasture ground.'),
(15673, 'Commonty', 'n.', 'A common; a piece of land in which two or more persons\n   have a common right.'),
(15674, 'Commorse', 'n.', 'Remorse.'),
(15675, 'Commote', 'v. t.', 'To commove; to disturb; to stir up.'),
(15676, 'Commoved', 'imp. & p. p.', 'of Commove'),
(15677, 'Commove', 'v. t.', 'To urge; to persuade; to incite.'),
(15678, 'Commove', 'v. t.', 'To put in motion; to disturb; to unsettle.'),
(15679, 'Communal', 'a.', 'Pertaining to a commune.'),
(15680, 'Communed', 'imp. & p. p.', 'of Commune'),
(15681, 'Commune', 'v. i.', 'To converse together with sympathy and confidence; to\n   interchange sentiments or feelings; to take counsel.'),
(15682, 'Commune', 'v. i.', 'To receive the communion; to partake of the eucharist\n   or Lord\'s supper.'),
(15683, 'Commune', 'n.', 'Communion; sympathetic intercourse or conversation between\n   friends.'),
(15684, 'Commune', 'n.', 'The commonalty; the common people.'),
(15685, 'Commune', 'n.', 'A small territorial district in France under the\n   government of a mayor and municipal council; also, the inhabitants, or\n   the government, of such a district. See Arrondissement.'),
(15686, 'Commune', 'n.', 'Absolute municipal self-government.'),
(15687, 'Commuted', 'imp. & p. p.', 'of Commute'),
(15688, 'Commute', 'v. t.', 'To exchange; to put or substitute something else in\n   place of, as a smaller penalty, obligation, or payment, for a greater,\n   or a single thing for an aggregate; hence, to lessen; to diminish; as,\n   to commute a sentence of death to one of imprisonment for life; to\n   commute tithes; to commute charges for fares.'),
(15689, 'Commute', 'v. i.', 'To obtain or bargain for exemption or substitution; to\n   effect a commutation.'),
(15690, 'Commute', 'v. i.', 'To pay, or arrange to pay, in gross instead of part by\n   part; as, to commute for a year\'s travel over a route.'),
(15691, 'Commuter', 'n.', 'One who commutes; especially, one who commutes in\n   traveling.'),
(15692, 'Comose', 'a.', 'Bearing a tuft of soft hairs or down, as the seeds of\n   milkweed.'),
(15693, 'Compact', 'p. p. & a', 'Joined or held together; leagued; confederated.'),
(15694, 'Compact', 'p. p. & a', 'Composed or made; -- with of.'),
(15695, 'Compact', 'p. p. & a', 'Closely or firmly united, as the particles of solid\n   bodies; firm; close; solid; dense.'),
(15696, 'Compact', 'p. p. & a', 'Brief; close; pithy; not diffuse; not verbose; as,\n   a compact discourse.'),
(15697, 'Compact', 'v. t.', 'To thrust, drive, or press closely together; to join\n   firmly; to consolidate; to make close; -- as the parts which compose a\n   body.'),
(15698, 'Compact', 'v. t.', 'To unite or connect firmly, as in a system.'),
(15699, 'Compact', 'n.', 'An agreement between parties; a covenant or contract.'),
(15700, 'Compages', 'v. t.', 'A system or structure of many parts united.'),
(15701, 'Company', 'n.', 'The state of being a companion or companions; the act of\n   accompanying; fellowship; companionship; society; friendly intercourse.'),
(15702, 'Company', 'n.', 'A companion or companions.'),
(15703, 'Company', 'n.', 'An assemblage or association of persons, either permanent\n   or transient.'),
(15704, 'Company', 'n.', 'Guests or visitors, in distinction from the members of a\n   family; as, to invite company to dine.'),
(15705, 'Company', 'n.', 'Society, in general; people assembled for social\n   intercourse.'),
(15706, 'Company', 'n.', 'An association of persons for the purpose of carrying on\n   some enterprise or business; a corporation; a firm; as, the East India\n   Company; an insurance company; a joint-stock company.'),
(15707, 'Company', 'n.', 'Partners in a firm whose names are not mentioned in its\n   style or title; -- often abbreviated in writing; as, Hottinguer & Co.'),
(15708, 'Company', 'n.', 'A subdivision of a regiment of troops under the command of\n   a captain, numbering in the United States (full strength) 100 men.'),
(15709, 'Company', 'n.', 'The crew of a ship, including the officers; as, a whole\n   ship\'s company.'),
(15710, 'Company', 'n.', 'The body of actors employed in a theater or in the\n   production of a play.'),
(15711, 'Company', 'v. t.', 'To accompany or go with; to be companion to.'),
(15712, 'Company', 'v. i.', 'To associate.'),
(15713, 'Company', 'v. i.', 'To be a gay companion.'),
(15714, 'Company', 'v. i.', 'To have sexual commerce.'),
(15715, 'Compared', 'imp. & p. p.', 'of Compare'),
(15716, 'Compare', 'v. t.', 'To examine the character or qualities of, as of two or\n   more persons or things, for the purpose of discovering their\n   resemblances or differences; to bring into comparison; to regard with\n   discriminating attention.'),
(15717, 'Compare', 'v. t.', 'To represent as similar, for the purpose of\n   illustration; to liken.'),
(15718, 'Compare', 'v. t.', 'To inflect according to the degrees of comparison; to\n   state positive, comparative, and superlative forms of; as, most\n   adjectives of one syllable are compared by affixing \"- er\" and \"-est\"\n   to the positive form; as, black, blacker, blackest; those of more than\n   one syllable are usually compared by prefixing \"more\" and \"most\", or\n   \"less\" and \"least\", to the positive; as, beautiful, more beautiful,\n   most beautiful.'),
(15719, 'Compare', 'v. i.', 'To be like or equal; to admit, or be worthy of,\n   comparison; as, his later work does not compare with his earlier.'),
(15720, 'Compare', 'v. i.', 'To vie; to assume a likeness or equality.'),
(15721, 'Compare', 'n.', 'Comparison.'),
(15722, 'Compare', 'n.', 'Illustration by comparison; simile.'),
(15723, 'Compare', 'v. t.', 'To get; to procure; to obtain; to acquire'),
(15724, 'Comparer', 'n.', 'One who compares.'),
(15725, 'Compart', 'v. t.', 'To divide; to mark out into parts or subdivisions.'),
(15726, 'Compass', 'n.', 'A passing round; circuit; circuitous course.'),
(15727, 'Compass', 'n.', 'An inclosing limit; boundary; circumference; as, within\n   the compass of an encircling wall.'),
(15728, 'Compass', 'n.', 'An inclosed space; an area; extent.'),
(15729, 'Compass', 'n.', 'Extent; reach; sweep; capacity; sphere; as, the compass of\n   his eye; the compass of imagination.'),
(15730, 'Compass', 'n.', 'Moderate bounds, limits of truth; moderation; due limits;\n   -- used with within.'),
(15731, 'Compass', 'n.', 'The range of notes, or tones, within the capacity of a\n   voice or instrument.'),
(15732, 'Compass', 'n.', 'An instrument for determining directions upon the earth\'s\n   surface by means of a magnetized bar or needle turning freely upon a\n   pivot and pointing in a northerly and southerly direction.'),
(15733, 'Compass', 'n.', 'A pair of compasses.'),
(15734, 'Compass', 'n.', 'A circle; a continent.'),
(15735, 'Compass', 'v. t.', 'To go about or entirely round; to make the circuit of.'),
(15736, 'Compass', 'v. t.', 'To inclose on all sides; to surround; to encircle; to\n   environ; to invest; to besiege; -- used with about, round, around, and\n   round about.'),
(15737, 'Compass', 'v. t.', 'To reach round; to circumvent; to get within one\'s\n   power; to obtain; to accomplish.'),
(15738, 'Compass', 'v. t.', 'To curve; to bend into a circular form.'),
(15739, 'Compass', 'v. t.', 'To purpose; to intend; to imagine; to plot.'),
(15740, 'Compear', 'v. i.', 'To appear.'),
(15741, 'Compear', 'v. i.', 'To appear in court personally or by attorney.'),
(15742, 'Compeer', '', 'An equal, as in rank, age, prowess, etc.; a companion; a\n   comrade; a mate.'),
(15743, 'Compeer', 'v. t.', 'To be equal with; to match.'),
(15744, 'Compeer', 'v. i.', 'Alt. of Compeir'),
(15745, 'Compeir', 'v. i.', 'See Compear.'),
(15746, 'Compel', 'v. t.', 'To drive or urge with force, or irresistibly; to force;\n   to constrain; to oblige; to necessitate, either by physical or moral\n   force.'),
(15747, 'Compel', 'v. t.', 'To take by force or violence; to seize; to exact; to\n   extort.'),
(15748, 'Compel', 'v. t.', 'To force to yield; to overpower; to subjugate.'),
(15749, 'Compel', 'v. t.', 'To gather or unite in a crowd or company.'),
(15750, 'Compel', 'v. t.', 'To call forth; to summon.'),
(15751, 'Compel', 'v. i.', 'To make one yield or submit.'),
(15752, 'Compend', 'n.', 'A compendium; an epitome; a summary.'),
(15753, 'Compense', 'v. t.', 'To compensate.'),
(15754, 'Compesce', 'v. t.', 'To hold in check; to restrain.'),
(15755, 'Competed', 'imp. & p. p.', 'of Compete'),
(15756, 'Compete', 'v. i.', 'To contend emulously; to seek or strive for the same\n   thing, position, or reward for which another is striving; to contend in\n   rivalry, as for a prize or in business; as, tradesmen compete with one\n   another.'),
(15757, 'Compiled', 'imp. & p. p.', 'of Compile'),
(15758, 'Compile', 'v. t.', 'To put together; to construct; to build.'),
(15759, 'Compile', 'v. t.', 'To contain or comprise.'),
(15760, 'Compile', 'v. t.', 'To put together in a new form out of materials already\n   existing; esp., to put together or compose out of materials from other\n   books or documents.'),
(15761, 'Compile', 'v. t.', 'To write; to compose.'),
(15762, 'Compiler', 'n.', 'One who compiles; esp., one who makes books by\n   compilation.'),
(15763, 'Compinge', 'v. t.', 'To compress; to shut up.'),
(15764, 'Complain', 'v. i.', 'To give utterance to expression of grief, pain,\n   censure, regret. etc.; to lament; to murmur; to find fault; -- commonly\n   used with of. Also, to creak or squeak, as a timber or wheel.'),
(15765, 'Complain', 'v. i.', 'To make a formal accusation; to make a charge.'),
(15766, 'Complain', 'v. t.', 'To lament; to bewail.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(15767, 'Complete', 'a.', 'Filled up; with no part or element lacking; free from\n   deficiency; entire; perfect; consummate.'),
(15768, 'Complete', 'a.', 'Finished; ended; concluded; completed; as, the edifice is\n   complete.'),
(15769, 'Complete', 'a.', 'Having all the parts or organs which belong to it or to\n   the typical form; having calyx, corolla, stamens, and pistil.'),
(15770, 'Complete', 'v. t.', 'To bring to a state in which there is no deficiency;\n   to perfect; to consummate; to accomplish; to fulfill; to finish; as, to\n   complete a task, or a poem; to complete a course of education.'),
(15771, 'Complex', 'n.', 'Composed of two or more parts; composite; not simple; as,\n   a complex being; a complex idea.'),
(15772, 'Complex', 'n.', 'Involving many parts; complicated; intricate.'),
(15773, 'Complex', 'n.', 'Assemblage of related things; collection; complication.'),
(15774, 'Complice', 'n.', 'An accomplice.'),
(15775, 'Complier', 'n.', 'One who complies, yields, or obeys; one of an easy,\n   yielding temper.'),
(15776, 'Compline', 'n.', 'Alt. of Complin'),
(15777, 'Complin', 'n.', 'The last division of the Roman Catholic breviary; the\n   seventh and last of the canonical hours of the Western church; the last\n   prayer of the day, to be said after sunset.'),
(15778, 'Complot', 'n.', 'A plotting together; a confederacy in some evil design; a\n   conspiracy.'),
(15779, 'Complot', 'v. t. & i.', 'To plot or plan together; to conspire; to join in\n   a secret design.'),
(15780, 'Complied', 'imp. & p. p.', 'of Comply'),
(15781, 'Comply', 'v. i.', 'To yield assent; to accord; agree, or acquiesce; to\n   adapt one\'s self; to consent or conform; -- usually followed by with.'),
(15782, 'Comply', 'v. i.', 'To be ceremoniously courteous; to make one\'s\n   compliments.'),
(15783, 'Comply', 'v. i.', 'To fulfill; to accomplish.'),
(15784, 'Comply', 'v. i.', 'To infold; to embrace.'),
(15785, 'Compone', 'v. t.', 'To compose; to settle; to arrange.'),
(15786, 'Compone', 'a.', 'See Compony.'),
(15787, 'Compony', 'a.', 'Alt. of Compone'),
(15788, 'Compone', 'a.', 'Divided into squares of alternate tinctures in a single\n   row; -- said of any bearing; or, in the case of a bearing having curved\n   lines, divided into patches of alternate colors following the curve. If\n   there are two rows it is called counter-compony.'),
(15789, 'Comport', 'v. i.', 'To bear or endure; to put up (with); as, to comport\n   with an injury.'),
(15790, 'Comport', 'v. i.', 'To agree; to accord; to suit; -- sometimes followed by\n   with.'),
(15791, 'Comport', 'v. t.', 'To bear; to endure; to brook; to put with.'),
(15792, 'Comport', 'v. t.', 'To carry; to conduct; -- with a reflexive pronoun.'),
(15793, 'Comport', 'n.', 'Manner of acting; behavior; conduct; deportment.'),
(15794, 'Composed', 'imp. & p. p.', 'of Compose'),
(15795, 'Compose', 'v. t.', 'To form by putting together two or more things or\n   parts; to put together; to make up; to fashion.'),
(15796, 'Compose', 'v. t.', 'To form the substance of, or part of the substance of;\n   to constitute.'),
(15797, 'Compose', 'v. t.', 'To construct by mental labor; to design and execute, or\n   put together, in a manner involving the adaptation of forms of\n   expression to ideas, or to the laws of harmony or proportion; as, to\n   compose a sentence, a sermon, a symphony, or a picture.'),
(15798, 'Compose', 'v. t.', 'To dispose in proper form; to reduce to order; to put\n   in proper state or condition; to adjust; to regulate.'),
(15799, 'Compose', 'v. t.', 'To free from agitation or disturbance; to tranquilize;\n   to soothe; to calm; to quiet.'),
(15800, 'Compose', 'v. t.', 'To arrange (types) in a composing stick in order for\n   printing; to set (type).'),
(15801, 'Compose', 'v. i.', 'To come to terms.'),
(15802, 'Composed', 'a.', 'Free from agitation; calm; sedate; quiet; tranquil;\n   self-possessed.'),
(15803, 'Composer', 'n.', 'One who composes; an author. Specifically, an author of a\n   piece of music.'),
(15804, 'Composer', 'n.', 'One who, or that which, quiets or calms; one who adjusts\n   a difference.'),
(15805, 'Compost', 'n.', 'A mixture; a compound.'),
(15806, 'Compost', 'n.', 'A mixture for fertilizing land; esp., a composition of\n   various substances (as muck, mold, lime, and stable manure) thoroughly\n   mingled and decomposed, as in a compost heap.'),
(15807, 'Compost', 'v. t.', 'To manure with compost.'),
(15808, 'Compost', 'v. t.', 'To mingle, as different fertilizing substances, in a\n   mass where they will decompose and form into a compost.'),
(15809, 'Compote', 'n.', 'A preparation of fruit in sirup in such a manner as to\n   preserve its form, either whole, halved, or quartered; as, a compote of\n   pears.'),
(15810, 'Compound', 'n.', 'In the East Indies, an inclosure containing a house,\n   outbuildings, etc.'),
(15811, 'Compound', 'v. t.', 'To form or make by combining different elements,\n   ingredients, or parts; as, to compound a medicine.'),
(15812, 'Compound', 'v. t.', 'To put together, as elements, ingredients, or parts,\n   in order to form a whole; to combine, mix, or unite.'),
(15813, 'Compound', 'v. t.', 'To modify or change by combination with some other\n   thing or part; to mingle with something else.'),
(15814, 'Compound', 'v. t.', 'To compose; to constitute.'),
(15815, 'Compound', 'v. t.', 'To settle amicably; to adjust by agreement; to\n   compromise; to discharge from obligation upon terms different from\n   those which were stipulated; as, to compound a debt.'),
(15816, 'Compound', 'v. i.', 'To effect a composition; to come to terms of\n   agreement; to agree; to settle by a compromise; -- usually followed by\n   with before the person participating, and for before the thing\n   compounded or the consideration.'),
(15817, 'Compound', 'v. t.', 'Composed of two or more elements, ingredients, parts;\n   produced by the union of several ingredients, parts, or things;\n   composite; as, a compound word.'),
(15818, 'Compound', 'n.', 'That which is compounded or formed by the union or\n   mixture of elements ingredients, or parts; a combination of simples; a\n   compound word; the result of composition.'),
(15819, 'Compound', 'n.', 'A union of two or more ingredients in definite\n   proportions by weight, so combined as to form a distinct substance; as,\n   water is a compound of oxygen and hydrogen.'),
(15820, 'Compress', 'v. t.', 'To press or squeeze together; to force into a narrower\n   compass; to reduce the volume of by pressure; to compact; to condense;\n   as, to compress air or water.'),
(15821, 'Compress', 'v. t.', 'To embrace sexually.'),
(15822, 'Compress', 'n.', 'A folded piece of cloth, pledget of lint, etc., used to\n   cover the dressing of wounds, and so placed as, by the aid of a\n   bandage, to make due pressure on any part.'),
(15823, 'Comprint', 'v. t. & i.', 'To print together.'),
(15824, 'Comprint', 'v. t. & i.', 'To print surreptitiously a work belonging to\n   another.'),
(15825, 'Comprint', 'n.', 'The surreptitious printing of another\'s copy or book; a\n   work thus printed.'),
(15826, 'Comprise', 'v. t.', 'To comprehend; to include.'),
(15827, 'Compt', 'n.', 'Account; reckoning; computation.'),
(15828, 'Compt', 'v. t.', 'To compute; to count.'),
(15829, 'Compt', 'a.', 'Neat; spruce.'),
(15830, 'Compter', 'n.', 'A counter.'),
(15831, 'Comptly', 'adv.', 'Neatly.'),
(15832, 'Comptrol', 'n. & v.', 'See Control.'),
(15833, 'Compunct', 'a.', 'Affected with compunction; conscience-stricken.'),
(15834, 'Computed', 'imp. & p. p.', 'of Compute'),
(15835, 'Compute', 'v. t.', 'To determine calculation; to reckon; to count.'),
(15836, 'Compute', 'n.', 'Computation.'),
(15837, 'Computer', 'n.', 'One who computes.'),
(15838, 'Comrade', 'n.', 'A mate, companion, or associate.'),
(15839, 'Comrogue', 'n.', 'A fellow rogue.'),
(15840, 'Comtism', 'n.', 'Positivism; the positive philosophy. See Positivism.'),
(15841, 'Comtist', 'n.', 'A disciple of Comte; a positivist.'),
(15842, 'Conned', 'imp. & p. p.', 'of Con'),
(15843, 'Conning', 'p. pr. & vb. n.', 'of Con'),
(15844, 'Conacre', 'v. t.', 'To underlet a portion of, for a single crop; -- said of\n   a farm.'),
(15845, 'Conacre', 'n.', 'A system of letting a portion of a farm for a single crop.'),
(15846, 'Conacre', 'n.', 'Also used adjectively; as, the conacre system or\n   principle.'),
(15847, 'Conarium', 'n.', 'The pineal gland.'),
(15848, 'Conation', 'n.', 'The power or act which directs or impels to effort of any\n   kind, whether muscular or psychical.'),
(15849, 'Conative', 'a.', 'Of or pertaining to conation.'),
(15850, 'Conatus', 'n.', 'A natural tendency inherent in a body to develop itself;\n   an attempt; an effort.'),
(15851, 'Concause', 'n.', 'A joint cause.'),
(15852, 'Concave', 'a.', 'Hollow and curved or rounded; vaulted; -- said of the\n   interior of a curved surface or line, as of the curve of the of the\n   inner surface of an eggshell, in opposition to convex; as, a concave\n   mirror; the concave arch of the sky.'),
(15853, 'Concave', 'a.', 'Hollow; void of contents.'),
(15854, 'Concave', 'n.', 'A hollow; an arched vault; a cavity; a recess.'),
(15855, 'Concave', 'n.', 'A curved sheath or breasting for a revolving cylinder or\n   roll.'),
(15856, 'Concaved', 'imp. & p. p.', 'of Concave'),
(15857, 'Concave', 'v. t.', 'To make hollow or concave.'),
(15858, 'Concaved', 'a.', 'Bowed in the form of an arch; -- called also arched.'),
(15859, 'Conceal', 'v. t.', 'To hide or withdraw from observation; to cover; to\n   cover or keep from sight; to prevent the discovery of; to withhold\n   knowledge of.'),
(15860, 'Conceded', 'imp. & p. p.', 'of Concede'),
(15861, 'Concede', 'v. t.', 'To yield or suffer; to surrender; to grant; as, to\n   concede the point in question.'),
(15862, 'Concede', 'v. t.', 'To grant, as a right or privilege; to make concession\n   of.'),
(15863, 'Concede', 'v. t.', 'To admit to be true; to acknowledge.'),
(15864, 'Concede', 'v. i.', 'To yield or make concession.'),
(15865, 'Conceit', 'n.', 'That which is conceived, imagined, or formed in the mind;\n   idea; thought; image; conception.'),
(15866, 'Conceit', 'n.', 'Faculty of conceiving ideas; mental faculty; apprehension;\n   as, a man of quick conceit.'),
(15867, 'Conceit', 'n.', 'Quickness of apprehension; active imagination; lively\n   fancy.'),
(15868, 'Conceit', 'n.', 'A fanciful, odd, or extravagant notion; a quant fancy; an\n   unnatural or affected conception; a witty thought or turn of\n   expression; a fanciful device; a whim; a quip.'),
(15869, 'Conceit', 'n.', 'An overweening idea of one\'s self; vanity.'),
(15870, 'Conceit', 'n.', 'Design; pattern.'),
(15871, 'Conceit', 'v. t.', 'To conceive; to imagine.'),
(15872, 'Conceit', 'v. i.', 'To form an idea; to think.'),
(15873, 'Conceive', 'v. t.', 'To receive into the womb and begin to breed; to begin\n   the formation of the embryo of.'),
(15874, 'Conceive', 'v. t.', 'To form in the mind; to plan; to devise; to generate;\n   to originate; as, to conceive a purpose, plan, hope.'),
(15875, 'Conceive', 'v. t.', 'To apprehend by reason or imagination; to take into\n   the mind; to know; to imagine; to comprehend; to understand.'),
(15876, 'Conceive', 'v. i.', 'To have an embryo or fetus formed in the womb; to\n   breed; to become pregnant.'),
(15877, 'Conceive', 'v. i.', 'To have a conception, idea, or opinion; think; -- with\n   of.'),
(15878, 'Concent', 'n.', 'Concert of voices; concord of sounds; harmony; as, a\n   concent of notes.'),
(15879, 'Concent', 'n.', 'Consistency; accordance.'),
(15880, 'Concept', 'n.', 'An abstract general conception; a notion; a universal.'),
(15881, 'Concern', 'v. t.', 'To relate or belong to; to have reference to or\n   connection with; to affect the interest of; to be of importance to.'),
(15882, 'Concern', 'v. t.', 'To engage by feeling or sentiment; to interest; as, a\n   good prince concerns himself in the happiness of his subjects.'),
(15883, 'Concern', 'v. i.', 'To be of importance.'),
(15884, 'Concern', 'n.', 'That which relates or belongs to one; business; affair.'),
(15885, 'Concern', 'n.', 'That which affects the welfare or happiness; interest;\n   moment.'),
(15886, 'Concern', 'n.', 'Interest in, or care for, any person or thing; regard;\n   solicitude; anxiety.'),
