(16121, 'Coniine', 'n.', 'See Conine.'),
(16122, 'Conimene', 'n.', 'Same as Olibene.'),
(16123, 'Conine', 'n.', 'A powerful and very poisonous vegetable alkaloid found in\n   the hemlock (Conium maculatum) and extracted as a colorless oil,\n   C8H17N, of strong repulsive odor and acrid taste. It is regarded as a\n   derivative of piperidine and likewise of one of the collidines. It\n   occasions a gradual paralysis of the motor nerves. Called also coniine,\n   coneine, conia, etc. See Conium, 2.'),
(16124, 'Conisor', 'n.', 'See Cognizor.'),
(16125, 'Conistra', 'n.', 'Originally, a part of the palestra, or gymnasium among\n   the Greeks; either the place where sand was stored for use in\n   sprinkling the wrestlers, or the wrestling ground itself. Hence, a part\n   of the orchestra of the Greek theater.'),
(16126, 'Conite', 'n.', 'A magnesian variety of dolomite.'),
(16127, 'Conium', 'n.', 'A genus of biennial, poisonous, white-flowered,\n   umbelliferous plants, bearing ribbed fruit (\"seeds\") and decompound\n   leaves.'),
(16128, 'Conium', 'n.', 'The common hemlock (Conium maculatum, poison hemlock,\n   spotted hemlock, poison parsley), a roadside weed of Europe, Asia, and\n   America, cultivated in the United States for medicinal purpose. It is\n   an active poison. The leaves and fruit are used in medicine.'),
(16129, 'Conject', 'n.', 'To throw together, or to throw.'),
(16130, 'Conject', 'v. t.', 'To conjecture; also, to plan.'),
(16131, 'Conjoin', 'v. t.', 'To join together; to unite.'),
(16132, 'Conjoin', 'v. i.', 'To unite; to join; to league.'),
(16133, 'Conjoint', 'a.', 'United; connected; associated.'),
(16134, 'Conjugal', 'a.', 'Belonging to marriage; suitable or appropriate to the\n   marriage state or to married persons; matrimonial; connubial.'),
(16135, 'Conjunct', 'a.', 'United; conjoined; concurrent.'),
(16136, 'Conjunct', 'a.', 'Same as Conjoined.'),
(16137, 'Conjured', 'imp. & p. p.', 'of Conjure'),
(16138, 'Conjure', 'v. t.', 'To call on or summon by a sacred name or in solemn\n   manner; to implore earnestly; to adjure.'),
(16139, 'Conjure', 'v. i.', 'To combine together by an oath; to conspire; to\n   confederate.'),
(16140, 'Conjure', 'v. t.', 'To affect or effect by conjuration; to call forth or\n   send away by magic arts; to excite or alter, as if by magic or by the\n   aid of supernatural powers.'),
(16141, 'Conjure', 'v. i.', 'To practice magical arts; to use the tricks of a\n   conjurer; to juggle; to charm.'),
(16142, 'Conjurer', 'n.', 'One who conjures; one who calls, entreats, or charges in\n   a solemn manner.'),
(16143, 'Conjurer', 'n.', 'One who practices magic arts; one who pretends to act by\n   the aid super natural power; also, one who performs feats of\n   legerdemain or sleight of hand.'),
(16144, 'Conjurer', 'n.', 'One who conjectures shrewdly or judges wisely; a man of\n   sagacity.'),
(16145, 'Conjuror', 'n.', 'One bound by a common oath with others.'),
(16146, 'Conjury', 'n.', 'The practice of magic; enchantment.'),
(16147, 'Connate', 'a.', 'Born with another; being of the same birth.'),
(16148, 'Connate', 'a.', 'Congenital; existing from birth.'),
(16149, 'Connate', 'a.', 'Congenitally united; growing from one base, or united at\n   their bases; united into one body; as, connate leaves or athers. See\n   Illust. of Connate-perfoliate.'),
(16150, 'Connect', 'v. t.', 'To join, or fasten together, as by something\n   intervening; to associate; to combine; to unite or link together; to\n   establish a bond or relation between.'),
(16151, 'Connect', 'v. t.', 'To associate (a person or thing, or one\'s self) with\n   another person, thing, business, or affair.'),
(16152, 'Connect', 'v. i.', 'To join, unite, or cohere; to have a close relation;\n   as, one line of railroad connects with another; one argument connect\n   with another.'),
(16153, 'Conner', 'n.', 'A marine European fish (Crenilabrus melops); also, the\n   related American cunner. See Cunner.'),
(16154, 'Connex', 'v. t.', 'To connect.'),
(16155, 'Connived', 'imp. & p. p.', 'of Connive'),
(16156, 'Connive', 'v. i.', 'To open and close the eyes rapidly; to wink.'),
(16157, 'Connive', 'v. i.', 'To close the eyes upon a fault; to wink (at); to fail\n   or forbear by intention to discover an act; to permit a proceeding, as\n   if not aware of it; -- usually followed by at.'),
(16158, 'Connive', 'v. t.', 'To shut the eyes to; to overlook; to pretend not to\n   see.'),
(16159, 'Conniver', 'n.', 'One who connives.'),
(16160, 'Connoted', 'imp. & p. p.', 'of Connote'),
(16161, 'Connote', 'v. t.', 'To mark along with; to suggest or indicate as\n   additional; to designate by implication; to include in the meaning; to\n   imply.'),
(16162, 'Connote', 'v. t.', 'To imply as an attribute.'),
(16163, 'Connusor', 'n.', 'See Cognizor.'),
(16164, 'Conny', 'a.', 'Brave; fine; canny.'),
(16165, 'Conodont', 'n.', 'A peculiar toothlike fossil of many forms, found\n   especially in carboniferous rocks. Such fossils are supposed by some to\n   be the teeth of marsipobranch fishes, but they are probably the jaws of\n   annelids.'),
(16166, 'Conoid', 'n.', 'Anything that has a form resembling that of a cone.'),
(16167, 'Conoid', 'n.', 'A solid formed by the revolution of a conic section about\n   its axis; as, a parabolic conoid, elliptic conoid, etc.; -- more\n   commonly called paraboloid, ellipsoid, etc.'),
(16168, 'Conoid', 'n.', 'A surface which may be generated by a straight line moving\n   in such a manner as always to meet a given straight line and a given\n   curve, and continue parallel to a given plane.'),
(16169, 'Conoid', 'a.', 'Resembling a cone; conoidal.'),
(16170, 'Conoidal', 'a.', 'Nearly, but not exactly, conical.'),
(16171, 'Conoidic', 'a.', 'Alt. of Conoidical'),
(16172, 'Conquer', 'v. t.', 'To gain or acquire by force; to take possession of by\n   violent means; to gain dominion over; to subdue by physical means; to\n   reduce; to overcome by force of arms; to cause to yield; to vanquish.'),
(16173, 'Conquer', 'v. t.', 'To subdue or overcome by mental or moral power; to\n   surmount; as, to conquer difficulties, temptation, etc.'),
(16174, 'Conquer', 'v. t.', 'To gain or obtain, overcoming obstacles in the way; to\n   win; as, to conquer freedom; to conquer a peace.'),
(16175, 'Conquer', 'v. i.', 'To gain the victory; to overcome; to prevail.'),
(16176, 'Conquest', 'n.', 'The act or process of conquering, or acquiring by force;\n   the act of overcoming or subduing opposition by force, whether physical\n   or moral; subjection; subjugation; victory.'),
(16177, 'Conquest', 'n.', 'That which is conquered; possession gained by force,\n   physical or moral.'),
(16178, 'Conquest', 'n.', 'The acquiring of property by other means than by\n   inheritance; acquisition.'),
(16179, 'Conquest', 'n.', 'The act of gaining or regaining by successful struggle;\n   as, the conquest of liberty or peace.'),
(16180, 'Consent', 'v. i.', 'To agree in opinion or sentiment; to be of the same\n   mind; to accord; to concur.'),
(16181, 'Consent', 'v. i.', 'To indicate or express a willingness; to yield to\n   guidance, persuasion, or necessity; to give assent or approval; to\n   comply.'),
(16182, 'Consent', 'v. t.', 'To grant; to allow; to assent to; to admit.'),
(16183, 'Consent', 'n.', 'Agreement in opinion or sentiment; the being of one mind;\n   accord.'),
(16184, 'Consent', 'n.', 'Correspondence in parts, qualities, or operations;\n   agreement; harmony; coherence.'),
(16185, 'Consent', 'n.', 'Voluntary accordance with, or concurrence in, what is done\n   or proposed by another; acquiescence; compliance; approval; permission.'),
(16186, 'Consent', 'n.', 'Capable, deliberate, and voluntary assent or agreement to,\n   or concurrence in, some act or purpose, implying physical and mental\n   power and free action.'),
(16187, 'Consent', 'n.', 'Sympathy. See Sympathy, 4.'),
(16188, 'Conserve', 'v. t.', 'To keep in a safe or sound state; to save; to\n   preserve; to protect.'),
(16189, 'Conserve', 'v. t.', 'To prepare with sugar, etc., for the purpose of\n   preservation, as fruits, etc.; to make a conserve of.'),
(16190, 'Conserve', 'n.', 'Anything which is conserved; especially, a sweetmeat\n   prepared with sugar; a confection.'),
(16191, 'Conserve', 'n.', 'A medicinal confection made of freshly gathered vegetable\n   substances mixed with finely powdered refined sugar. See Confection.'),
(16192, 'Conserve', 'n.', 'A conservatory.'),
(16193, 'Consider', 'v. t.', 'To fix the mind on, with a view to a careful\n   examination; to think on with care; to ponder; to study; to meditate\n   on.'),
(16194, 'Consider', 'v. t.', 'To look at attentively; to observe; to examine.'),
(16195, 'Consider', 'v. t.', 'To have regard to; to take into view or account; to\n   pay due attention to; to respect.'),
(16196, 'Consider', 'v. t.', 'To estimate; to think; to regard; to view.'),
(16197, 'Consider', 'v. i.', 'To think seriously; to make examination; to reflect;\n   to deliberate.'),
(16198, 'Consider', 'v. i.', 'To hesitate.'),
(16199, 'Consign', 'v. t.', 'To give, transfer, or deliver, in a formal manner, as\n   if by signing over into the possession of another, or into a different\n   state, with the sense of fixedness in that state, or permanence of\n   possession; as, to consign the body to the grave.'),
(16200, 'Consign', 'v. t.', 'To give in charge; to commit; to intrust.'),
(16201, 'Consign', 'v. t.', 'To send or address (by bill of lading or otherwise) to\n   an agent or correspondent in another place, to be cared for or sold, or\n   for the use of such correspondent; as, to consign a cargo or a ship; to\n   consign goods.'),
(16202, 'Consign', 'v. t.', 'To assign; to devote; to set apart.'),
(16203, 'Consign', 'v. t.', 'To stamp or impress; to affect.'),
(16204, 'Consign', 'v. i.', 'To submit; to surrender or yield one\'s self.'),
(16205, 'Consign', 'v. i.', 'To yield consent; to agree; to acquiesce.'),
(16206, 'Consigne', 'n.', 'A countersign; a watchword.'),
(16207, 'Consigne', 'n.', 'One who is orders to keep within certain limits.'),
(16208, 'Consist', 'v. i.', 'To stand firm; to be in a fixed or permanent state, as\n   a body composed of parts in union or connection; to hold together; to\n   be; to exist; to subsist; to be supported and maintained.'),
(16209, 'Consist', 'v. i.', 'To be composed or made up; -- followed by of.'),
(16210, 'Consist', 'v. i.', 'To have as its substance or character, or as its\n   foundation; to be; -- followed by in.'),
(16211, 'Consist', 'v. i.', 'To be consistent or harmonious; to be in accordance; --\n   formerly used absolutely, now followed by with.'),
(16212, 'Consist', 'v. i.', 'To insist; -- followed by on.'),
(16213, 'Consoled', 'imp. & p. p.', 'of Console'),
(16214, 'Console', 'v. t.', 'To cheer in distress or depression; to alleviate the\n   grief and raise the spirits of; to relieve; to comfort; to soothe.'),
(16215, 'Console', 'n.', 'A bracket whose projection is not more than half its\n   height.'),
(16216, 'Console', 'n.', 'Any small bracket; also, a console table.'),
(16217, 'Consoler', 'n.', 'One who gives consolation.'),
(16218, 'Consols', 'n. pl. ', 'The leading British funded government security.'),
(16219, 'Consomme', 'n.', 'A clear soup or bouillion boiled down so as to be very\n   rich.'),
(16220, 'Consort', 'n.', 'One who shares the lot of another; a companion; a partner;\n   especially, a wife or husband.'),
(16221, 'Consort', 'n.', 'A ship keeping company with another.'),
(16222, 'Consort', 'n.', 'Concurrence; conjunction; combination; association; union.'),
(16223, 'Consort', 'n.', 'An assembly or association of persons; a company; a group;\n   a combination.'),
(16224, 'Consort', 'n.', 'Harmony of sounds; concert, as of musical instruments.'),
(16225, 'Consort', 'v. i.', 'To unite or to keep company; to associate; -- used with\n   with.'),
(16226, 'Consort', 'v. t.', 'To unite or join, as in affection, harmony, company,\n   marriage, etc.; to associate.'),
(16227, 'Consort', 'v. t.', 'To attend; to accompany.'),
(16228, 'Consound', 'n.', 'A name applied loosely to several plants of different\n   genera, esp. the comfrey.'),
(16229, 'Conspire', 'v. i.', 'To make an agreement, esp. a secret agreement, to do\n   some act, as to commit treason or a crime, or to do some unlawful deed;\n   to plot together.'),
(16230, 'Conspire', 'v. i.', 'To concur to one end; to agree.'),
(16231, 'Conspire', 'v. t.', 'To plot; to plan; to combine for.'),
(16232, 'Constant', 'v. t.', 'Firm; solid; fixed; immovable; -- opposed to fluid.'),
(16233, 'Constant', 'v. t.', 'Not liable, or given, to change; permanent; regular;\n   continuous; continually recurring; steadfast; faithful; not fickle.'),
(16234, 'Constant', 'v. t.', 'Remaining unchanged or invariable, as a quantity,\n   force, law, etc.'),
(16235, 'Constant', 'v. t.', 'Consistent; logical.'),
(16236, 'Constant', 'n.', 'That which is not subject to change; that which is\n   invariable.'),
(16237, 'Constant', 'n.', 'A quantity that does not change its value; -- used in\n   countradistinction to variable.'),
(16238, 'Constat', 'n.', 'A certificate showing what appears upon record touching a\n   matter in question.'),
(16239, 'Constate', 'v. t.', 'To ascertain; to verify; to establish; to prove.'),
(16240, 'Construe', 'v. t. ', 'To apply the rules of syntax to (a sentence or\n   clause) so as to exhibit the structure, arrangement, or connection of,\n   or to discover the sense; to explain the construction of; to interpret;\n   to translate.'),
(16241, 'Construe', 'v. t. ', 'To put a construction upon; to explain the sense or\n   intention of; to interpret; to understand.'),
(16242, 'Consul', 'n.', 'One of the two chief magistrates of the republic.'),
(16243, 'Consul', 'n.', 'A senator; a counselor.'),
(16244, 'Consul', 'n.', 'One of the three chief magistrates of France from 1799 to\n   1804, who were called, respectively, first, second, and third consul.'),
(16245, 'Consul', 'n.', 'An official commissioned to reside in some foreign country,\n   to care for the commercial interests of the citizens of the appointing\n   government, and to protect its seamen.'),
(16246, 'Consular', 'a.', 'Of or pertaining to a consul; performing the duties of a\n   consul; as, consular power; consular dignity; consular officers.'),
(16247, 'Consult', 'v. i.', 'To seek the opinion or advice of another; to take\n   counsel; to deliberate together; to confer.'),
(16248, 'Consult', 'v. t.', 'To ask advice of; to seek the opinion of; to apply to\n   for information or instruction; to refer to; as, to consult a\n   physician; to consult a dictionary.'),
(16249, 'Consult', 'v. t.', 'To have reference to, in judging or acting; to have\n   regard to; to consider; as, to consult one\'s wishes.'),
(16250, 'Consult', 'v. t.', 'To deliberate upon; to take for.'),
(16251, 'Consult', 'v. t.', 'To bring about by counsel or contrivance; to devise; to\n   contrive.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(16252, 'Consult', 'n.', 'The act of consulting or deliberating; consultation; also,\n   the result of consulation; determination; decision.'),
(16253, 'Consult', 'n.', 'A council; a meeting for consultation.'),
(16254, 'Consult', 'n.', 'Agreement; concert'),
(16255, 'Consumed', 'imp. & p. p.', 'of Consume'),
(16256, 'Consume', 'v. t.', 'To destroy, as by decomposition, dissipation, waste, or\n   fire; to use up; to expend; to waste; to burn up; to eat up; to devour.'),
(16257, 'Consume', 'v. i.', 'To waste away slowly.'),
(16258, 'Consumer', 'n.', 'One who, or that which, consumes; as, the consumer of\n   food.'),
(16259, 'Contact', 'n.', 'A close union or junction of bodies; a touching or\n   meeting.'),
(16260, 'Contact', 'n.', 'The property of two curves, or surfaces, which meet, and\n   at the point of meeting have a common direction.'),
(16261, 'Contact', 'n.', 'The plane between two adjacent bodies of dissimilar rock.'),
(16262, 'Contain', 'v. t.', 'To hold within fixed limits; to comprise; to include;\n   to inclose; to hold.'),
(16263, 'Contain', 'v. t.', 'To have capacity for; to be able to hold; to hold; to\n   be equivalent to; as, a bushel contains four pecks.'),
(16264, 'Contain', 'v. t.', 'To put constraint upon; to restrain; to confine; to\n   keep within bounds.'),
(16265, 'Contain', 'v. i.', 'To restrain desire; to live in continence or chastity.'),
(16266, 'Contango', 'n.', 'The premium or interest paid by the buyer to the seller,\n   to be allowed to defer paying for the stock purchased until the next\n   fortnightly settlement day.'),
(16267, 'Contango', 'n.', 'The postponement of payment by the buyer of stock on the\n   payment of a premium to the seller. See Backwardation.'),
(16268, 'Contek', 'n.', 'Quarrel; contention; contest.'),
(16269, 'Contek', 'n.', 'Contumely; reproach.'),
(16270, 'Contemn', 'v. t.', 'To view or treat with contempt, as mean and despicable;\n   to reject with disdain; to despise; to scorn.'),
(16271, 'Contempt', 'n.', 'The act of contemning or despising; the feeling with\n   which one regards that which is esteemed mean, vile, or worthless;\n   disdain; scorn.'),
(16272, 'Contempt', 'n.', 'The state of being despised; disgrace; shame.'),
(16273, 'Contempt', 'n.', 'An act or expression denoting contempt.'),
(16274, 'Contempt', 'n.', 'Disobedience of the rules, orders, or process of a court\n   of justice, or of rules or orders of a legislative body; disorderly,\n   contemptuous, or insolent language or behavior in presence of a court,\n   tending to disturb its proceedings, or impair the respect due to its\n   authority.'),
(16275, 'Contend', 'v. i.', 'To strive in opposition; to contest; to dispute; to\n   vie; to quarrel; to fight.'),
(16276, 'Contend', 'v. i.', 'To struggle or exert one\'s self to obtain or retain\n   possession of, or to defend.'),
(16277, 'Contend', 'v. i.', 'To strive in debate; to engage in discussion; to\n   dispute; to argue.'),
(16278, 'Contend', 'v. t.', 'To struggle for; to contest.'),
(16279, 'Content', 'a.', 'Contained within limits; hence, having the desires limited\n   by that which one has; not disposed to repine or grumble; satisfied;\n   contented; at rest.'),
(16280, 'Contents', 'pl. ', 'of Content'),
(16281, 'Content', 'n.', 'That which is contained; the thing or things held by a\n   receptacle or included within specified limits; as, the contents of a\n   cask or bale or of a room; the contents of a book.'),
(16282, 'Content', 'n.', 'Power of containing; capacity; extent; size.'),
(16283, 'Content', 'n.', 'Area or quantity of space or matter contained within\n   certain limits; as, solid contents; superficial contents.'),
(16284, 'Content', 'a.', 'To satisfy the desires of; to make easy in any situation;\n   to appease or quiet; to gratify; to please.'),
(16285, 'Content', 'a.', 'To satisfy the expectations of; to pay; to requite.'),
(16286, 'Content', 'n.', 'Rest or quietness of the mind in one\'s present condition;\n   freedom from discontent; satisfaction; contentment; moderate happiness.'),
(16287, 'Content', 'n.', 'Acquiescence without examination.'),
(16288, 'Content', 'n.', 'That which contents or satisfies; that which if attained\n   would make one happy.'),
(16289, 'Content', 'n.', 'An expression of assent to a bill or motion; an\n   affirmative vote; also, a member who votes \"Content.\".'),
(16290, 'Contents', 'n. pl.', 'See Content, n.'),
(16291, 'Contest', 'v. t.', 'To make a subject of dispute, contention, litigation,\n   or emulation; to contend for; to call in question; to controvert; to\n   oppose; to dispute.'),
(16292, 'Contest', 'v. t.', 'To strive earnestly to hold or maintain; to struggle to\n   defend; as, the troops contested every inch of ground.'),
(16293, 'Contest', 'v. t.', 'To make a subject of litigation; to defend, as a suit;\n   to dispute or resist; as a claim, by course of law; to controvert.'),
(16294, 'Contest', 'v. i.', 'To engage in contention, or emulation; to contend; to\n   strive; to vie; to emulate; -- followed usually by with.'),
(16295, 'Contest', 'n.', 'Earnest dispute; strife in argument; controversy; debate;\n   altercation.'),
(16296, 'Contest', 'n.', 'Earnest struggle for superiority, victory, defense, etc.;\n   competition; emulation; strife in arms; conflict; combat; encounter.'),
(16297, 'Contex', 'v. t.', 'To context.'),
(16298, 'Context', 'a.', 'Knit or woven together; close; firm.'),
(16299, 'Context', 'n.', 'The part or parts of something written or printed, as of\n   Scripture, which precede or follow a text or quoted sentence, or are so\n   intimately associated with it as to throw light upon its meaning.'),
(16300, 'Context', 'v. t.', 'To knit or bind together; to unite closely.'),
(16301, 'Continue', 'v. i.', 'To remain in a given place or condition; to remain in\n   connection with; to abide; to stay.'),
(16302, 'Continue', 'v. i.', 'To be permanent or durable; to endure; to last.'),
(16303, 'Continue', 'v. i.', 'To be steadfast or constant in any course; to\n   persevere; to abide; to endure; to persist; to keep up or maintain a\n   particular condition, course, or series of actions; as, the army\n   continued to advance.'),
(16304, 'Continue', 'v. t.', 'To unite; to connect.'),
(16305, 'Continue', 'v. t.', 'To protract or extend in duration; to preserve or\n   persist in; to cease not.'),
(16306, 'Continue', 'v. t.', 'To carry onward or extend; to prolong or produce; to\n   add to or draw out in length.'),
(16307, 'Continue', 'v. t.', 'To retain; to suffer or cause to remain; as, the\n   trustees were continued; also, to suffer to live.'),
(16308, 'Continuo', 'n.', 'Basso continuo, or continued bass.'),
(16309, 'Contline', 'n.', 'The space between the strands on the outside of a rope.'),
(16310, 'Contline', 'n.', 'The space between the bilges of two casks stowed side by\n   side.'),
(16311, 'Contort', 'v. t.', 'To twist, or twist together; to turn awry; to bend; to\n   distort; to wrest.'),
(16312, 'Contour', 'n.', 'The outline of a figure or body, or the line or lines\n   representing such an outline; the line that bounds; periphery.'),
(16313, 'Contour', 'n.', 'The outline of a horizontal section of the ground, or of\n   works of fortification.'),
(16314, 'Contra', '', 'A Latin adverb and preposition, signifying against, contrary,\n   in opposition, etc., entering as a prefix into the composition of many\n   English words. Cf. Counter, adv. & pref.'),
(16315, 'Contract', 'n.', 'To draw together or nearer; to reduce to a less compass;\n   to shorten, narrow, or lessen; as, to contract one\'s sphere of action.'),
(16316, 'Contract', 'n.', 'To draw together so as to wrinkle; to knit.'),
(16317, 'Contract', 'n.', 'To bring on; to incur; to acquire; as, to contract a\n   habit; to contract a debt; to contract a disease.'),
(16318, 'Contract', 'n.', 'To enter into, with mutual obligations; to make a bargain\n   or covenant for.'),
(16319, 'Contract', 'n.', 'To betroth; to affiance.'),
(16320, 'Contract', 'n.', 'To shorten by omitting a letter or letters or by reducing\n   two or more vowels or syllables to one.'),
(16321, 'Contract', 'v. i.', 'To be drawn together so as to be diminished in size or\n   extent; to shrink; to be reduced in compass or in duration; as, iron\n   contracts in cooling; a rope contracts when wet.'),
(16322, 'Contract', 'v. i.', 'To make an agreement; to covenant; to agree; to\n   bargain; as, to contract for carrying the mail.'),
(16323, 'Contract', 'a.', 'Contracted; as, a contract verb.'),
(16324, 'Contract', 'a.', 'Contracted; affianced; betrothed.'),
(16325, 'Contract', 'n.', 'The agreement of two or more persons, upon a sufficient\n   consideration or cause, to do, or to abstain from doing, some act; an\n   agreement in which a party undertakes to do, or not to do, a particular\n   thing; a formal bargain; a compact; an interchange of legal rights.'),
(16326, 'Contract', 'n.', 'A formal writing which contains the agreement of parties,\n   with the terms and conditions, and which serves as a proof of the\n   obligation.'),
(16327, 'Contract', 'n.', 'The act of formally betrothing a man and woman.'),
(16328, 'Contrary', 'a.', 'Opposite; in an opposite direction; in opposition;\n   adverse; as, contrary winds.'),
(16329, 'Contrary', 'a.', 'Opposed; contradictory; repugnant; inconsistent.'),
(16330, 'Contrary', 'a.', 'Given to opposition; perverse; forward; wayward; as, a\n   contrary disposition; a contrary child.'),
(16331, 'Contrary', 'a.', 'Affirming the opposite; so opposed as to destroy each\n   other; as, contrary propositions.'),
(16332, 'Contrary', 'n.', 'A thing that is of contrary or opposite qualities.'),
(16333, 'Contrary', 'n.', 'An opponent; an enemy.'),
(16334, 'Contrary', 'n.', 'the opposite; a proposition, fact, or condition\n   incompatible with another; as, slender proofs which rather show the\n   contrary. See Converse, n., 1.'),
(16335, 'Contrary', 'n.', 'See Contraries.'),
(16336, 'Contrast', 'v. i.', 'To stand in opposition; to exhibit difference,\n   unlikeness, or opposition of qualities.'),
(16337, 'Contrast', 'v. t.', 'To set in opposition, or over against, in order to\n   show the differences between, or the comparative excellences and\n   defects of; to compare by difference or contrariety of qualities; as,\n   to contrast the present with the past.'),
(16338, 'Contrast', 'v. t.', 'To give greater effect to, as to a figure or other\n   object, by putting it in some relation of opposition to another figure\n   or object.'),
(16339, 'Contrast', 'n.', 'The act of contrasting, or the state of being contrasted;\n   comparison by contrariety of qualities.'),
(16340, 'Contrast', 'n.', 'Opposition or dissimilitude of things or qualities;\n   unlikeness, esp. as shown by juxtaposition or comparison.'),
(16341, 'Contrast', 'n.', 'The opposition of varied forms, colors, etc., which by\n   such juxtaposition more vividly express each other\'s peculiarities.'),
(16342, 'Contrate', 'a.', 'Having cogs or teeth projecting parallel to the axis,\n   instead of radiating from it.'),
(16343, 'Contrist', 'v. t.', 'To make sad.'),
(16344, 'Contrite', 'a.', 'Thoroughly bruised or broken.'),
(16345, 'Contrite', 'a.', 'Broken down with grief and penitence; deeply sorrowful\n   for sin because it is displeasing to God; humbly and thoroughly\n   penitent.'),
(16346, 'Contrite', 'n.', 'A contrite person.'),
(16347, 'Contrite', 'v.', 'In a contrite manner.'),
