(16349, 'Contrive', 'v. i.', 'To make devices; to form designs; to plan; to scheme;\n   to plot.'),
(16350, 'Control', 'n.', 'A duplicate book, register, or account, kept to correct or\n   check another account or register; a counter register.'),
(16351, 'Control', 'n.', 'That which serves to check, restrain, or hinder;\n   restraint.'),
(16352, 'Control', 'n.', 'Power or authority to check or restrain; restraining or\n   regulating influence; superintendence; government; as, children should\n   be under parental control.'),
(16353, 'Control', 'v. t.', 'To check by a counter register or duplicate account; to\n   prove by counter statements; to confute.'),
(16354, 'Control', 'v. t.', 'To exercise restraining or governing influence over; to\n   check; to counteract; to restrain; to regulate; to govern; to\n   overpower.'),
(16355, 'Contused', 'imp. & p. p.', 'of Contuse'),
