(16358, 'Conure', 'n.', 'An American parrakeet of the genus Conurus. Many species\n   are known. See Parrakeet.'),
(16359, 'Conus', 'n.', 'A cone.'),
(16360, 'Conus', 'n.', 'A Linnean genus of mollusks having a conical shell. See\n   Cone, n., 4.'),
(16361, 'Conusant', 'a.', 'See Cognizant.'),
(16362, 'Conusor', 'n.', 'See Cognizor.'),
(16363, 'Convened', 'imp. & p. p.', 'of Convene'),
(16364, 'Convene', 'v. i.', 'To come together; to meet; to unite.'),
(16365, 'Convene', 'v. i.', 'To come together, as in one body or for a public\n   purpose; to meet; to assemble.'),
(16366, 'Convene', 'v. t.', 'To cause to assemble; to call together; to convoke.'),
(16367, 'Convene', 'v. t.', 'To summon judicially to meet or appear.'),
(16368, 'Convener', 'n.', 'One who convenes or meets with others.'),
(16369, 'Convener', 'n.', 'One who calls an assembly together or convenes a meeting;\n   hence, the chairman of a committee or other organized body.'),
(16370, 'Convent', 'v. i.', 'A coming together; a meeting.'),
(16371, 'Convent', 'v. i.', 'An association or community of recluses devoted to a\n   religious life; a body of monks or nuns.'),
(16372, 'Convent', 'v. i.', 'A house occupied by a community of religious recluses;\n   a monastery or nunnery.'),
(16373, 'Convent', 'v. i.', 'To meet together; to concur.'),
(16374, 'Convent', 'v. i.', 'To be convenient; to serve.'),
(16375, 'Convent', 'v. t.', 'To call before a judge or judicature; to summon; to\n   convene.'),
(16376, 'Converge', 'v. i.', 'To tend to one point; to incline and approach nearer\n   together; as, lines converge.'),
(16377, 'Converge', 'v. t.', 'To cause to tend to one point; to cause to incline and\n   approach nearer together.'),
(16378, 'Converse', 'v. i.', 'To keep company; to hold intimate intercourse; to\n   commune; -- followed by with.'),
(16379, 'Converse', 'v. i.', 'To engage in familiar colloquy; to interchange\n   thoughts and opinions in a free, informal manner; to chat; -- followed\n   by with before a person; by on, about, concerning, etc., before a\n   thing.'),
(16380, 'Converse', 'v. i.', 'To have knowledge of, from long intercourse or study;\n   -- said of things.'),
(16381, 'Converse', 'n.', 'Frequent intercourse; familiar communion; intimate\n   association.'),
(16382, 'Converse', 'n.', 'Familiar discourse; free interchange of thoughts or\n   views; conversation; chat.'),
(16383, 'Converse', 'a.', 'Turned about; reversed in order or relation; reciprocal;\n   as, a converse proposition.'),
(16384, 'Converse', 'n.', 'A proposition which arises from interchanging the terms\n   of another, as by putting the predicate for the subject, and the\n   subject for the predicate; as, no virtue is vice, no vice is virtue.'),
(16385, 'Converse', 'n.', 'A proposition in which, after a conclusion from something\n   supposed has been drawn, the order is inverted, making the conclusion\n   the supposition or premises, what was first supposed becoming now the\n   conclusion or inference. Thus, if two sides of a sides of a triangle\n   are equal, the angles opposite the sides are equal; and the converse is\n   true, i.e., if these angles are equal, the two sides are equal.'),
(16386, 'Convert', 'v. t.', 'To cause to turn; to turn.'),
(16387, 'Convert', 'v. t.', 'To change or turn from one state or condition to\n   another; to alter in form, substance, or quality; to transform; to\n   transmute; as, to convert water into ice.'),
(16388, 'Convert', 'v. t.', 'To change or turn from one belief or course to another,\n   as from one religion to another or from one party or sect to another.'),
(16389, 'Convert', 'v. t.', 'To produce the spiritual change called conversion in\n   (any one); to turn from a bad life to a good one; to change the heart\n   and moral character of (any one) from the controlling power of sin to\n   that of holiness.'),
(16390, 'Convert', 'v. t.', 'To apply to any use by a diversion from the proper or\n   intended use; to appropriate dishonestly or illegally.'),
(16391, 'Convert', 'v. t.', 'To exchange for some specified equivalent; as, to\n   convert goods into money.'),
(16392, 'Convert', 'v. t.', 'To change (one proposition) into another, so that what\n   was the subject of the first becomes the predicate of the second.'),
(16393, 'Convert', 'v. t.', 'To turn into another language; to translate.'),
(16394, 'Convert', 'v. i.', 'To be turned or changed in character or direction; to\n   undergo a change, physically or morally.'),
(16395, 'Convert', 'n.', 'A person who is converted from one opinion or practice to\n   another; a person who is won over to, or heartily embraces, a creed,\n   religious system, or party, in which he has not previously believed;\n   especially, one who turns from the controlling power of sin to that of\n   holiness, or from unbelief to Christianity.'),
(16396, 'Convert', 'n.', 'A lay friar or brother, permitted to enter a monastery for\n   the service of the house, but without orders, and not allowed to sing\n   in the choir.'),
(16397, 'Convex', 'a.', 'Rising or swelling into a spherical or rounded form;\n   regularly protuberant or bulging; -- said of a spherical surface or\n   curved line when viewed from without, in opposition to concave.'),
(16398, 'Convex', 'n.', 'A convex body or surface.'),
(16399, 'Convexed', 'a.', 'Made convex; protuberant in a spherical form.'),
(16400, 'Convexly', 'adv.', 'In a convex form; as, a body convexly shaped.'),
(16401, 'Conveyed', 'imp. & p. p.', 'of Convey'),
(16402, 'Convey', 'v. t.', 'To carry from one place to another; to bear or\n   transport.'),
(16403, 'Convey', 'v. t.', 'To cause to pass from one place or person to another; to\n   serve as a medium in carrying (anything) from one place or person to\n   another; to transmit; as, air conveys sound; words convey ideas.'),
(16404, 'Convey', 'v. t.', 'To transfer or deliver to another; to make over, as\n   property; more strictly (Law), to transfer (real estate) or pass (a\n   title to real estate) by a sealed writing.'),
(16405, 'Convey', 'v. t.', 'To impart or communicate; as, to convey an impression;\n   to convey information.'),
(16406, 'Convey', 'v. t.', 'To manage with privacy; to carry out.'),
(16407, 'Convey', 'v. t.', 'To carry or take away secretly; to steal; to thieve.'),
(16408, 'Convey', 'v. t.', 'To accompany; to convoy.'),
(16409, 'Convey', 'v. i.', 'To play the thief; to steal.'),
