(16411, 'Conveyer', 'n.', 'One given to artifices or secret practices; a juggler; a\n   cheat; a thief.'),
(16412, 'Conveyor', 'n.', 'A contrivance for carrying objects from place to place;\n   esp., one for conveying grain, coal, etc., -- as a spiral or screw\n   turning in a pipe or trough, an endless belt with buckets, or a truck\n   running along a rope.'),
(16413, 'Convict', 'p.a.', 'Proved or found guilty; convicted.'),
(16414, 'Convict', 'n.', 'A person proved guilty of a crime alleged against him; one\n   legally convicted or sentenced to punishment for some crime.'),
(16415, 'Convict', 'n.', 'A criminal sentenced to penal servitude.'),
(16416, 'Convict', 'v. t.', 'To prove or find guilty of an offense or crime charged;\n   to pronounce guilty, as by legal decision, or by one\'s conscience.'),
(16417, 'Convict', 'v. t.', 'To prove or show to be false; to confute; to refute.'),
(16418, 'Convict', 'v. t.', 'To demonstrate by proof or evidence; to prove.'),
(16419, 'Convict', 'v. t.', 'To defeat; to doom to destruction.'),
(16420, 'Convince', 'v. t.', 'To overpower; to overcome; to subdue or master.'),
(16421, 'Convince', 'v. t.', 'To overcome by argument; to force to yield assent to\n   truth; to satisfy by proof.'),
(16422, 'Convince', 'v. t.', 'To confute; to prove the fallacy of.'),
(16423, 'Convince', 'v. t.', 'To prove guilty; to convict.'),
(16424, 'Convival', 'a.', 'pertaining to a feast or to festivity; convivial.'),
(16425, 'Convive', 'v. i.', 'To feast together; to be convivial.'),
(16426, 'Convive', 'n.', 'A quest at a banquet.'),
(16427, 'Convoked', 'imp. & p. p.', 'of Convoke'),
(16428, 'Convoke', 'v. t.', 'To call together; to summon to meet; to assemble by\n   summons.'),
(16429, 'Convolve', 'v. t.', 'To roll or wind together; to roll or twist one part on\n   another.'),
(16430, 'Convoyed', 'imp. & p. p.', 'of Convoy'),
(16431, 'Convoy', 'v. t.', 'To accompany for protection, either by sea or land; to\n   attend for protection; to escort; as, a frigate convoys a merchantman.'),
(16432, 'Convoy', 'n.', 'The act of attending for defense; the state of being so\n   attended; protection; escort.'),
(16433, 'Convoy', 'n.', 'A vessel or fleet, or a train or trains of wagons, employed\n   in the transportation of munitions of war, money, subsistence,\n   clothing, etc., and having an armed escort.'),
(16434, 'Convoy', 'n.', 'A protection force accompanying ships, etc., on their way\n   from place to place, by sea or land; an escort, for protection or\n   guidance.'),
(16435, 'Convoy', 'n.', 'Conveyance; means of transportation.'),
(16436, 'Convoy', 'n.', 'A drag or brake applied to the wheels of a carriage, to\n   check their velocity in going down a hill.'),
(16437, 'Convulse', 'v. t.', 'To contract violently and irregulary, as the muscular\n   parts of an animal body; to shake with irregular spasms, as in\n   excessive laughter, or in agony from grief or pain.'),
