(16439, 'Conylene', 'n.', 'An oily substance, C8H14, obtained from several\n   derivatives of conine.'),
(16440, 'Conyrine', 'n.', 'A blue, fluorescent, oily base (regarded as a derivative\n   of pyridine), obtained from conine.'),
