(16466, 'Coolly', 'adv.', 'In a cool manner; without heat or excessive cold; without\n   passion or ardor; calmly; deliberately; with indifference; impudently.'),
(16467, 'Coolness', 'n.', 'The state of being cool; a moderate degree of cold; a\n   moderate degree, or a want, of passion; want of ardor, zeal, or\n   affection; calmness.'),
