(16493, 'Copaiba', 'n.', 'Alt. of Copaiva'),
(16494, 'Copaiva', 'n.', 'A more or less viscid, yellowish liquid, the bitter\n   oleoresin of several species of Copaifera, a genus of trees growing in\n   South America and the West Indies. It is stimulant and diuretic, and is\n   much used in affections of the mucous membranes; -- called also balsam\n   of copaiba.'),
(16495, 'Copal', '', 'A resinous substance flowing spontaneously from trees of\n   Zanzibar, Madagascar, and South America (Trachylobium Hornemannianum,\n   T. verrucosum, and Hymenaea Courbaril), and dug from earth where\n   forests have stood in Africa; -- used chiefly in making varnishes.'),
(16496, 'Copart', 'v. t.', 'To share.'),
(16497, 'Copatain', 'a.', 'Having a high crown, or a point or peak at top.'),
