(16499, 'Coping', 'p. pr. & vb. n.', 'of Cope'),
(16500, 'Copeck', 'n.', 'A Russian copper coin. See Kopeck.'),
(16501, 'Coped', 'a.', 'Clad in a cope.'),
(16502, 'Copelata', 'n. pl.', 'See Larvalla.'),
(16503, 'Copeman', 'v. i.', 'A chapman; a dealer; a merchant.'),
(16504, 'Copepod', 'a.', 'Of or pertaining to the Copepoda.'),
(16505, 'Copepod', 'n.', 'One of the Copepoda.'),
(16506, 'Copepoda', 'n. pl.', 'An order of Entomostraca, including many minute\n   Crustacea, both fresh-water and marine.'),
(16507, 'Copier', 'n.', 'One who copies; one who writes or transcribes from an\n   original; a transcriber.'),
(16508, 'Copier', 'n.', 'An imitator; one who imitates an example; hence, a\n   plagiarist.'),
(16509, 'Coping', 'n.', 'The highest or covering course of masonry in a wall, often\n   with sloping edges to carry off water; -- sometimes called capping.'),
(16510, 'Copious', 'a.', 'Large in quantity or amount; plentiful; abundant;\n   fruitful.'),
(16511, 'Copist', 'n.', 'A copier.'),
(16512, 'Coplaner', 'a.', 'Situated in one plane.'),
(16513, 'Copland', 'n.', 'A piece of ground terminating in a point or acute angle.'),
(16514, 'Copped', 'a.', 'Rising to a point or head; conical; pointed; crested.'),
(16515, 'Coppel', 'n. & v.', 'See Cupel.'),
(16516, 'Copper', 'n.', 'A common metal of a reddish color, both ductile and\n   malleable, and very tenacious. It is one of the best conductors of heat\n   and electricity. Symbol Cu. Atomic weight 63.3. It is one of the most\n   useful metals in itself, and also in its alloys, brass and bronze.'),
(16517, 'Copper', 'n.', 'A coin made of copper; a penny, cent, or other minor coin\n   of copper.'),
(16518, 'Copper', 'n.', 'A vessel, especially a large boiler, made of copper.'),
(16519, 'Copper', 'n.', 'the boilers in the galley for cooking; as, a ship\'s\n   coppers.'),
(16520, 'Coppered', 'imp. & p. p.', 'of Copper'),
(16521, 'Copper', 'v. t.', 'To cover or coat with copper; to sheathe with sheets of\n   copper; as, to copper a ship.'),
(16522, 'Copperas', 'n.', 'Green vitriol, or sulphate of iron; a green crystalline\n   substance, of an astringent taste, used in making ink, in dyeing black,\n   as a tonic in medicine, etc. It is made on a large scale by the\n   oxidation of iron pyrites. Called also ferrous sulphate.'),
(16523, 'Coppery', 'a.', 'Mixed with copper; containing copper, or made of copper;\n   like copper.'),
(16524, 'Coppice', 'n.', 'A grove of small growth; a thicket of brushwood; a wood\n   cut at certain times for fuel or other purposes. See Copse.'),
(16525, 'Coppin', 'n.', 'A cop of thread.'),
(16526, 'Copple', 'n.', 'Something rising in a conical shape; specifically, a hill\n   rising to a point.'),
(16527, 'Coppled', 'a.', 'Rising to a point; conical; copped.'),
(16528, 'Copps', 'n.', 'See Copse.'),
(16529, 'Copra', 'n.', 'The dried meat of the cocoanut, from which cocoanut oil is\n   expressed.'),
(16530, 'Cop-rose', 'n.', 'The red, or corn, poppy.'),
(16531, 'Copse', 'n.', 'A wood of small growth; a thicket of brushwood. See Coppice.'),
(16532, 'Copse', 'v. t.', 'To trim or cut; -- said of small trees, brushwood, tufts\n   of grass, etc.'),
(16533, 'Copse', 'v. t.', 'To plant and preserve, as a copse.'),
(16534, 'Copsy', 'a.', 'Characterized by copses.'),
(16535, 'Coptic', 'a.', 'Of or pertaining to the Copts.'),
(16536, 'Coptic', 'n.', 'The language of the Copts.'),
(16537, 'Copts', 'n. pl.', 'An Egyptian race thought to be descendants of the\n   ancient Egyptians.'),
(16538, 'Copts', 'n. pl.', 'The principal sect of Christians in Egypt and the valley\n   of the Nile.'),
(16539, 'Copula', 'n.', 'The word which unites the subject and predicate.'),
(16540, 'Copula', 'n.', 'The stop which connects the manuals, or the manuals with\n   the pedals; -- called also coupler.'),
(16541, 'Copulate', 'a.', 'Joined; associated; coupled.'),
