(16543, 'Copulate', 'v. i.', 'To unite in sexual intercourse; to come together in\n   the act of generation.'),
(16544, 'Coplatry', 'a.', 'Pertaining to copulation; tending or serving to unite;\n   copulative.'),
(16545, 'Coplatry', 'a.', 'Used in sexual union; as, the copulatory organs of\n   insects.'),
(16546, 'Copies', 'pl. ', 'of Copy'),
(16547, 'Copied', 'imp. & p. p.', 'of Copy'),
(16548, 'Copying', 'p. pr. & vb. n.', 'of Copy'),
(16549, 'Copyer', 'n.', 'See Copier.'),
(16550, 'Copyhold', 'n.', 'A tenure of estate by copy of court roll; or a tenure for\n   which the tenant has nothing to show, except the rolls made by the\n   steward of the lord\'s court.'),
(16551, 'Copyhold', 'n.', 'Land held in copyhold.'),
(16552, 'Copying', 'a. & n.', 'From Copy, v.'),
(16553, 'Copyist', 'n.', 'A copier; a transcriber; an imitator; a plagiarist.'),
(16554, 'Coquet', 'v. t.', 'To attempt to attract the notice, admiration, or love\n   of; to treat with a show of tenderness or regard, with a view to\n   deceive and disappoint.'),
(16555, 'Coquet', 'v. i.', 'To trifle in love; to stimulate affection or interest;\n   to play the coquette; to deal playfully instead of seriously; to play\n   (with); as, we have coquetted with political crime.'),
(16556, 'Coquetry', 'n.', 'Attempts to attract admiration, notice, or love, for the\n   mere gratification of vanity; trifling in love.'),
(16557, 'Coquette', 'n.', 'A vain, trifling woman, who endeavors to attract\n   admiration from a desire to gratify vanity; a flirt; -- formerly\n   sometimes applied also to men.'),
(16558, 'Coquette', 'n.', 'A tropical humming bird of the genus Lophornis, with very\n   elegant neck plumes. Several species are known. See Illustration under\n   Spangle, v. t.'),
(16559, 'Coquina', 'n.', 'A soft, whitish, coral-like stone, formed of broken shells\n   and corals, found in the southern United States, and used for roadbeds\n   and for building material, as in the fort at St. Augustine, Florida.'),
(16560, 'Coracle', 'n.', 'A boat made by covering a wicker frame with leather or\n   oilcloth. It was used by the ancient Britons, and is still used by\n   fisherman in Wales and some parts of Ireland. Also, a similar boat used\n   in Thibet and in Egypt.'),
(16561, 'Coracoid', 'a.', 'Shaped like a crow\'s beak.'),
(16562, 'Coracoid', 'a.', 'Pertaining to a bone of the shoulder girdle in most\n   birds, reptiles, and amphibians, which is reduced to a process of the\n   scapula in most mammals.'),
(16563, 'Coracoid', 'n.', 'The coracoid bone or process.'),
(16564, 'Corage', 'n.', 'See Courage'),
(16565, 'Coral', 'n.', 'The hard parts or skeleton of various Anthozoa, and of a few\n   Hydrozoa. Similar structures are also formed by some Bryozoa.'),
(16566, 'Coral', 'n.', 'The ovaries of a cooked lobster; -- so called from their\n   color.'),
(16567, 'Coral', 'n.', 'A piece of coral, usually fitted with small bells and other\n   appurtenances, used by children as a plaything.'),
(16568, 'Coraled', 'a.', 'Having coral; covered with coral.'),
(16569, 'Corallin', 'n.', 'A yellow coal-tar dyestuff which probably consists\n   chiefly of rosolic acid. See Aurin, and Rosolic acid under Rosolic.'),
(16570, 'Corallum', 'n.', 'The coral or skeleton of a zoophyte, whether calcareous\n   of horny, simple or compound. See Coral.'),
(16571, 'Coranach', 'n.', 'A lamentation for the dead; a dirge.'),
(16572, 'Corant', 'n.', 'Alt. of Coranto'),
(16573, 'Coranto', 'n.', 'A sprightly but somewhat stately dance, now out of\n   fashion.'),
(16574, 'Corban', 'n.', 'An offering of any kind, devoted to God and therefore not\n   to be appropriated to any other use; esp., an offering in fulfillment\n   of a vow.'),
(16575, 'Corban', 'n.', 'An alms basket; a vessel to receive gifts of charity; a\n   treasury of the church, where offerings are deposited.'),
(16576, 'Corbe', 'a.', 'Crooked.'),
(16577, 'Corbell', 'n.', 'A sculptured basket of flowers; a corbel.'),
(16578, 'Corbell', 'n.', 'Small gabions.'),
(16579, 'Corbel', 'n.', 'A bracket supporting a superincumbent object, or receiving\n   the spring of an arch. Corbels were employed largely in Gothic\n   architecture.'),
(16580, 'Corbel', 'v. t.', 'To furnish with a corbel or corbels; to support by a\n   corbel; to make in the form of a corbel.'),
(16581, 'Corbies', 'pl. ', 'of Corby'),
(16582, 'Corbie', 'n.', 'Alt. of Corby'),
(16583, 'Corby', 'n.', 'The raven.'),
(16584, 'Corby', 'n.', 'A raven, crow, or chough, used as a charge.'),
(16585, 'Corcle', 'n.', 'Alt. of Corcule'),
(16586, 'Corcule', 'n.', 'The heart of the seed; the embryo or germ.'),
(16587, 'Corded', 'imp. & p. p.', 'of Cord'),
(16588, 'Cording', 'p. pr. & vb. n.', 'of Cord'),
(16589, 'Cordage', 'n.', 'Ropes or cords, collectively; hence, anything made of rope\n   or cord, as those parts of the rigging of a ship which consist of\n   ropes.'),
(16590, 'Cordal', 'n.', 'Same as Cordelle.'),
(16591, 'Cordate', 'a.', 'Heart-shaped; as, a cordate leaf.'),
(16592, 'Corded', 'a.', 'Bound or fastened with cords.'),
(16593, 'Corded', 'a.', 'Piled in a form for measurement by the cord.'),
(16594, 'Corded', 'a.', 'Made of cords.'),
(16595, 'Corded', 'a.', 'Striped or ribbed with cords; as, cloth with a corded\n   surface.'),
(16596, 'Corded', 'a.', 'Bound about, or wound, with cords.'),
(16597, 'Cordelle', 'n.', 'A twisted cord; a tassel.'),
(16598, 'Cordial', 'a.', 'Proceeding from the heart.'),
(16599, 'Cordial', 'a.', 'Hearty; sincere; warm; affectionate.'),
(16600, 'Cordial', 'a.', 'Tending to revive, cheer, or invigorate; giving strength\n   or spirits.'),
(16601, 'Cordial', 'n.', 'Anything that comforts, gladdens, and exhilarates.'),
(16602, 'Cordial', 'n.', 'Any invigorating and stimulating preparation; as, a\n   peppermint cordial.'),
(16603, 'Cordial', 'n.', 'Aromatized and sweetened spirit, used as a beverage; a\n   liqueur.'),
(16604, 'Cordiner', 'n.', 'A cordwainer.'),
(16605, 'Cordon', 'n.', 'A cord or ribbon bestowed or borne as a badge of honor; a\n   broad ribbon, usually worn after the manner of a baldric, constituting\n   a mark of a very high grade in an honorary order. Cf. Grand cordon.'),
(16606, 'Cordon', 'n.', 'The cord worn by a Franciscan friar.'),
(16607, 'Cordon', 'n.', 'The coping of the scarp wall, which projects beyong the\n   face of the wall a few inches.'),
(16608, 'Cordon', 'n.', 'A line or series of sentinels, or of military posts,\n   inclosing or guarding any place or thing.'),
(16609, 'Cordon', 'n.', 'A rich and ornamental lace or string, used to secure a\n   mantle in some costumes of state.'),
(16610, 'Cordovan', 'n.', 'Same as Cordwain. In England the name is applied to\n   leather made from horsehide.'),
(16611, 'Corduroy', 'n.', 'A sort of cotton velveteen, having the surface raised in\n   ridges.'),
(16612, 'Corduroy', 'n.', 'Trousers or breeches of corduroy.'),
(16613, 'Corduroy', 'v. t.', 'To form of logs laid side by side.'),
(16614, 'Cordwain', 'n.', 'A term used in the Middle Ages for Spanish leather\n   (goatskin tanned and dressed), and hence, any leather handsomely\n   finished, colored, gilded, or the like.'),
(16615, 'Coring', 'p. pr. & vb. n.', 'of Core'),
(16616, 'Corer', 'n.', 'That which cores; an instrument for coring fruit; as, an\n   apple corer.'),
(16617, 'Corves', 'pl. ', 'of Corf'),
(16618, 'Corfiote', 'n.', 'Alt. of Corfute'),
(16619, 'Corfute', 'n.', 'A native or inhabitant of Corfu, an island in the\n   Mediterranean Sea.'),
(16620, 'Coridine', 'n.', 'A colorless or yellowish oil, C10H15N, of a leathery\n   odor, occuring in coal tar, Dippel\'s oil, tobacco smoke, etc., regarded\n   as an organic base, homologous with pyridine. Also, one of a series of\n   metameric compounds of which coridine is a type.'),
(16621, 'Corindon', 'n.', 'See Corrundum.'),
(16622, 'Corinne', 'n.', 'The common gazelle (Gazella dorcas). See Gazelle.'),
(16623, 'Corinth', 'n.', 'A city of Greece, famed for its luxury and extravagance.'),
(16624, 'Corinth', 'n.', 'A small fruit; a currant.'),
(16625, 'Corium', 'n.', 'Armor made of leather, particularly that used by the\n   Romans; used also by Enlish soldiers till the reign of Edward I.'),
(16626, 'Corium', 'n.', 'Same as Dermis.'),
(16627, 'Corium', 'n.', 'The deep layer of mucous membranes beneath the epithelium.'),
(16628, 'Corival', 'n.', 'A rival; a corrival.'),
(16629, 'Corival', 'v. t.', 'To rival; to pretend to equal.'),
(16630, 'Corked', 'imp. & p. p.', 'of Cork'),
(16631, 'Corking', 'p. pr. & vb. n.', 'of Cork'),
(16632, 'Corkage', 'n.', 'The charge made by innkeepers for drawing the cork and\n   taking care of bottles of wine bought elsewhere by a guest.'),
(16633, 'Corked', 'a.', 'having acquired an unpleasant taste from the cork; as, a\n   bottle of wine is corked.'),
(16634, 'Corkwing', 'n.', 'A fish; the goldsinny.'),
(16635, 'Corky', 'a.', 'Consisting of, or like, cork; dry shriveled up.'),
(16636, 'Corky', 'a.', 'Tasting of cork.'),
(16637, 'Cormus', 'n.', 'See Corm.'),
(16638, 'Cormus', 'n.', 'A vegetable or animal made up of a number of individuals,\n   such as, for example, would be formed by a process of budding from a\n   parent stalk wherre the buds remain attached.'),
(16639, 'Corned', 'imp. & p. p.', 'of Corn'),
(16640, 'Corning', 'p. pr. & vb. n.', 'of Corn'),
(16641, 'Cornage', 'n.', 'Anancient tenure of land, which obliged the tenant to give\n   notice of an invasion by blowing a horn.'),
(16642, 'Cornbind', 'n.', 'A weed that binds stalks of corn, as Convolvulus\n   arvensis, Polygonum Convolvulus.'),
(16643, 'Corncob', 'n.', 'The cob or axis on which the kernels of Indian corn grow.'),
(16644, 'Corncrib', 'n.', 'A crib for storing corn.'),
(16645, 'Corneas', 'pl. ', 'of Cornea'),
(16646, 'Cornea', 'n.', 'The transparent part of the coat of the eyeball which\n   covers the iris and pupil and admits light to the interior. See Eye.'),
(16647, 'Corneal', 'a.', 'Pertaining to the cornea.'),
(16648, 'Cornel', 'n.', 'The cornelian cherry (Cornus Mas), a European shrub with\n   clusters of small, greenish flowers, followed by very acid but edible\n   drupes resembling cherries.'),
(16649, 'Cornel', 'n.', 'Any species of the genus Cornus, as C. florida, the\n   flowering cornel; C. stolonifera, the osier cornel; C. Canadensis, the\n   dwarf cornel, or bunchberry.'),
(16650, 'Corner', 'n.', 'The point where two converging lines meet; an angle, either\n   external or internal.'),
(16651, 'Corner', 'n.', 'The space in the angle between converging lines or walls\n   which meet in a point; as, the chimney corner.'),
(16652, 'Corner', 'n.', 'An edge or extremity; the part farthest from the center;\n   hence, any quarter or part.'),
(16653, 'Corner', 'n.', 'A secret or secluded place; a remote or out of the way\n   place; a nook.'),
(16654, 'Corner', 'n.', 'Direction; quarter.'),
(16655, 'Corner', 'n.', 'The state of things produced by a combination of persons,\n   who buy up the whole or the available part of any stock or species of\n   property, which compels those who need such stock or property to buy of\n   them at their own price; as, a corner in a railway stock.'),
(16656, 'Cornered', 'imp. & p. p.', 'of Corner'),
(16657, 'Corner', 'v. t.', 'To drive into a corner.'),
(16658, 'Corner', 'v. t.', 'To drive into a position of great difficulty or hopeless\n   embarrassment; as, to corner a person in argument.'),
(16659, 'Corner', 'v. t.', 'To get command of (a stock, commodity, etc.), so as to\n   be able to put one\'s own price on it; as, to corner the shares of a\n   railroad stock; to corner petroleum.'),
(16660, 'Cornered', 'p. a.', '1 Having corners or angles.'),
(16661, 'Cornered', 'p. a.', 'In a possition of great difficulty; brought to bay.'),
(16662, 'Cornet', 'n.', 'An obsolete rude reed instrument (Ger. Zinken), of the oboe\n   family.'),
(16663, 'Cornet', 'n.', 'A brass instrument, with cupped mouthpiece, and furnished\n   with valves or pistons, now used in bands, and, in place of the\n   trumpet, in orchestras. See Cornet-a-piston.'),
(16664, 'Cornet', 'n.', 'A certain organ stop or register.'),
(16665, 'Cornet', 'n.', 'A cap of paper twisted at the end, used by retailers to\n   inclose small wares.'),
(16666, 'Cornet', 'n.', 'A troop of cavalry; -- so called from its being accompanied\n   by a cornet player.'),
(16667, 'Cornet', 'n.', 'The standard of such a troop.'),
(16668, 'Cornet', 'n.', 'The lowest grade of commissioned officer in a British\n   cavalry troop, who carried the standard. The office was abolished in\n   1871.'),
(16669, 'Cornet', 'n.', 'A headdress'),
(16670, 'Cornet', 'n.', 'A square cap anciently worn as a mark of certain\n   professions.'),
(16671, 'Cornet', 'n.', 'A part of a woman\'s headdress, in the 16th century.'),
(16672, 'Cornet', 'n.', 'See Coronet, 2.'),
(16673, 'Cornetcy', 'n.', 'The commission or rank of a cornet.'),
(16674, 'Corneter', 'n.', 'One who blows a cornet.'),
(16675, 'Corneule', 'n.', 'One of the corneas of a compound eye in the\n   invertebrates.'),
(16676, 'Cornic', 'a.', 'Pertaining to, derived from, or resembling, the dogwood\n   (Cornus florida).'),
(16677, 'Cornice', 'n.', 'Any horizontal, molded or otherwise decorated projection\n   which crowns or finishes the part to which it is affixed; as, the\n   cornice of an order, pedestal, door, window, or house.'),
(16678, 'Corniced', 'a.', 'Having a cornice.'),
(16679, 'Cornicle', 'n.', 'A little horn.'),
(16680, 'Cornific', 'a.', 'Producing horns; forming horn.'),
(16681, 'Cornin', 'n.', 'A bitter principle obtained from dogwood (Cornus florida),\n   as a white crystalline substance; -- called also cornic acid.'),
(16682, 'Cornin', 'n.', 'An extract from dogwood used as a febrifuge.'),
(16683, 'Cornish', 'a.', 'Of or pertaining to Cornwall, in England.'),
(16684, 'Cornish', 'n.', 'The dialect, or the people, of Cornwall.'),
(16685, 'Cornist', 'n.', 'A performer on the cornet or horn.'),
(16686, 'Cornloft', 'n.', 'A loft for corn; a granary.'),
(16687, 'Cornmuse', 'n.', 'A cornemuse.'),
(16688, 'Corni', '-n/', 'di basseto (pl. ) of Corno di bassetto'),
(16689, 'Cornua', 'pl. ', 'of Cornu'),
(16690, 'Cornu', 'n.', 'A horn, or anything shaped like or resembling a horn.'),
(16691, 'Cornute', 'a.', 'Alt. of Cornuted'),
(16692, 'Cornuted', 'a.', 'Bearing horns; horned; horn-shaped.'),
(16693, 'Cornuted', 'a.', 'Cuckolded.'),
(16694, 'Cornute', 'v. t.', 'To bestow horns upon; to make a cuckold of; to cuckold.'),
(16695, 'Cornuto', 'n.', 'A man that wears the horns; a cuckold.'),
(16696, 'Cornutor', 'n.', 'A cuckold maker.'),
(16697, 'Corny', 'a.', 'Strong, stiff, or hard, like a horn; resembling horn.'),
(16698, 'Corny', 'a.', 'Producing corn or grain; furnished with grains of corn.'),
(16699, 'Corny', 'a.', 'Containing corn; tasting well of malt.'),
(16700, 'Corny', 'a.', 'Tipsy.'),
(16701, 'Corocore', 'n.', 'A kind of boat of various forms, used in the Indian\n   Archipelago.'),
(16702, 'Corody', 'n.', 'An allowance of meat, drink, or clothing due from an abbey\n   or other religious house for the sustenance of such of the king\'s\n   servants as he may designate to receive it.'),
(16703, 'Corol', 'n.', 'A corolla.'),
(16704, 'Corolla', 'n.', 'The inner envelope of a flower; the part which surrounds\n   the organs of fructification, consisting of one or more leaves, called\n   petals. It is usually distinguished from the calyx by the fineness of\n   its texture and the gayness of its colors. See the Note under Blossom.'),
(16705, 'Corollet', 'n.', 'A floret in an aggregate flower.'),
(16706, 'Coronae', 'pl. ', 'of Corona'),
(16707, 'Coronas', 'pl. ', 'of Corona'),
(16708, 'Corona', 'n.', 'A crown or garland bestowed among the Romans as a reward\n   for distinguished services.'),
(16709, 'Corona', 'n.', 'The projecting part of a Classic cornice, the under side of\n   which is cut with a recess or channel so as to form a drip. See Illust.\n   of Column.'),
(16710, 'Corona', 'n.', 'The upper surface of some part, as of a tooth or the skull;\n   a crown.'),
(16711, 'Corona', 'n.', 'The shelly skeleton of a sea urchin.'),
(16712, 'Corona', 'n.', 'A peculiar luminous appearance, or aureola, which surrounds\n   the sun, and which is seen only when the sun is totally eclipsed by the\n   moon.'),
(16713, 'Corona', 'n.', 'An inner appendage to a petal or a corolla, often forming a\n   special cup, as in the daffodil and jonquil.'),
(16714, 'Corona', 'n.', 'Any crownlike appendage at the top of an organ.'),
(16715, 'Corona', 'n.', 'A circle, usually colored, seen in peculiar states of the\n   atmosphere around and close to a luminous body, as the sun or moon.'),
(16716, 'Corona', 'n.', 'A peculiar phase of the aurora borealis, formed by the\n   concentration or convergence of luminous beams around the point in the\n   heavens indicated by the direction of the dipping needle.'),
(16717, 'Corona', 'n.', 'A crown or circlet suspended from the roof or vaulting of\n   churches, to hold tapers lighted on solemn occasions. It is sometimes\n   formed of double or triple circlets, arranged pyramidically. Called\n   also corona lucis.'),
(16718, 'Corona', 'n.', 'A character [/] called the pause or hold.'),
(16719, 'Coronach', 'n.', 'See Coranach.'),
(16720, 'Coronal', 'a.', 'Of or pertaining to a corona (in any of the senses).'),
(16721, 'Coronal', 'a.', 'Of or pertaining to a king\'s crown, or coronation.'),
(16722, 'Coronal', 'a.', 'Of or pertaining to the top of the head or skull.'),
(16723, 'Coronal', 'a.', 'Of or pertaining to the shell of a sea urchin.'),
(16724, 'Coronal', 'n.', 'A crown; wreath; garland.'),
(16725, 'Coronal', 'n.', 'The frontal bone, over which the ancients wore their\n   coronae or garlands.'),
(16726, 'Coronary', 'a.', 'Of or pertaining to a crown; forming, or adapted to form,\n   a crown or garland.'),
(16727, 'Coronary', 'a.', 'Resembling, or situated like, a crown or circlet; as, the\n   coronary arteries and veins of the heart.'),
(16728, 'Coronary', 'n.', 'A small bone in the foot of a horse.'),
(16729, 'Coronary', 'n.', 'Informal shortening of coronary thrombosis, also used\n   generally to mean heart attack.'),
(16730, 'Coronate', 'a.', 'Alt. of Coronated'),
(16731, 'Coronel', 'n.', 'A colonel.'),
(16732, 'Coronel', 'n.', 'The iron head of a tilting spear, divided into two, three,\n   or four blunt points.'),
(16733, 'Coroner', 'n.', 'An officer of the peace whose principal duty is to\n   inquire, with the help of a jury, into the cause of any violent, sudden\n   or mysterious death, or death in prison, usually on sight of the body\n   and at the place where the death occurred.'),
(16734, 'Coronet', 'n.', 'An ornamental or honorary headdress, having the shape and\n   character of a crown; particularly, a crown worn as the mark of high\n   rank lower than sovereignty. The word is used by Shakespeare to denote\n   also a kingly crown.'),
(16735, 'Coronet', 'n.', 'The upper part of a horse\'s hoof, where the horn\n   terminates in skin.'),
(16736, 'Coronet', 'n.', 'The iron head of a tilting spear; a coronel.'),
(16737, 'Coronis', 'n.', 'In Greek grammar, a sign [\'] sometimes placed over a\n   contracted syllable.'),
(16738, 'Coronis', 'n.', 'The curved line or flourish at the end of a book or\n   chapter; hence, the end.'),
(16739, 'Coronoid', 'a.', 'Resembling the beak of a crow; as, the coronoid process\n   of the jaw, or of the ulna.'),
(16740, 'Coronule', 'n.', 'A coronet or little crown of a seed; the downy tuft on\n   seeds. See Pappus.'),
(16741, 'Coroun', 'v. & n.', 'Crown.'),
(16742, 'Corozo', 'n.', 'Alt. of Corosso'),
(16743, 'Corosso', 'n.', 'The name in Central America for the seed of a true palm;\n   also, a commercial name for the true ivory nut. See Ivory nut.'),
(16744, 'Corporal', 'n.', 'A noncommissioned officer, next below a sergeant. In the\n   United States army he is the lowest noncommissioned officer in a\n   company of infantry. He places and relieves sentinels.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(16745, 'Corporal', 'a.', 'Belonging or relating to the body; bodily.'),
(16746, 'Corporal', 'a.', 'Having a body or substance; not spiritual; material. In\n   this sense now usually written corporeal.'),
(16747, 'Corporal', 'a.', 'Alt. of Corporale'),
(16748, 'Corporas', 'n.', 'The corporal, or communion cloth.'),
(16749, 'Corps', 'n. sing. & pl.', 'The human body, whether living or dead.'),
(16750, 'Corps', 'n. sing. & pl.', 'A body of men; esp., an organized division of\n   the military establishment; as, the marine corps; the corps of\n   topographical engineers; specifically, an army corps.'),
(16751, 'Corps', 'n. sing. & pl.', 'A body or code of laws.'),
(16752, 'Corps', 'n. sing. & pl.', 'The land with which a prebend or other\n   ecclesiastical office is endowed.'),
(16753, 'Corpse', 'n.', 'A human body in general, whether living or dead; --\n   sometimes contemptuously.'),
(16754, 'Corpse', 'n.', 'The dead body of a human being; -- used also Fig.'),
(16755, 'Corpora', 'pl. ', 'of Corpus'),
(16756, 'Corpus', 'n.', 'A body, living or dead; the corporeal substance of a thing.'),
(16757, 'Corrade', 'v. t.', 'To gnaw into; to wear away; to fret; to consume.'),
(16758, 'Corrade', 'v. t.', 'To erode, as the bed of a stream. See Corrosion.'),
(16759, 'Corral', 'n.', 'A pen for animals; esp., an inclosure made with wagons, by\n   emigrants in the vicinity of hostile Indians, as a place of security\n   for horses, cattle, etc.'),
(16760, 'Corraled', 'imp. & p. p.', 'of Corral'),
(16761, 'Corral', 'v. t.', 'To surround and inclose; to coop up; to put into an\n   inclosed space; -- primarily used with reference to securing horses and\n   cattle in an inclosure of wagons while traversing the plains, but in\n   the Southwestern United States now colloquially applied to the\n   capturing, securing, or penning of anything.'),
(16762, 'Correct', 'a.', 'Set right, or made straight; hence, conformable to truth,\n   rectitude, or propriety, or to a just standard; not faulty or\n   imperfect; free from error; as, correct behavior; correct views.'),
(16763, 'Correct', 'v. t.', 'To make right; to bring to the standard of truth,\n   justice, or propriety; to rectify; as, to correct manners or\n   principles.'),
(16764, 'Correct', 'v. t.', 'To remove or retrench the faults or errors of; to\n   amend; to set right; as, to correct the proof (that is, to mark upon\n   the margin the changes to be made, or to make in the type the changes\n   so marked).'),
(16765, 'Correct', 'v. t.', 'To bring back, or attempt to bring back, to propriety\n   in morals; to reprove or punish for faults or deviations from moral\n   rectitude; to chastise; to discipline; as, a child should be corrected\n   for lying.'),
(16766, 'Correct', 'v. t.', 'To counteract the qualities of one thing by those of\n   another; -- said of whatever is wrong or injurious; as, to correct the\n   acidity of the stomach by alkaline preparations.'),
(16767, 'Correi', 'n.', 'A hollow in the side of a hill, where game usually lies.'),
(16768, 'Corridor', 'n.', 'A gallery or passageway leading to several apartments of\n   a house.'),
(16769, 'Corridor', 'n.', 'The covered way lying round the whole compass of the\n   fortifications of a place.'),
(16770, 'Corrie', 'n.', 'Same as Correi.'),
(16771, 'Corrival', 'n.', 'A fellow rival; a competitor; a rival; also, a companion.'),
(16772, 'Corrival', 'a.', 'Having rivaling claims; emulous; in rivalry.'),
(16773, 'Corrival', 'v. i. & t.', 'To compete with; to rival.'),
(16774, 'Corroded', 'imp. & p. p.', 'of Corrode'),
(16775, 'Corrode', 'v. t.', 'To eat away by degrees; to wear away or diminish by\n   gradually separating or destroying small particles of, as by action of\n   a strong acid or a caustic alkali.'),
(16776, 'Corrode', 'v. t.', 'To consume; to wear away; to prey upon; to impair.'),
(16777, 'Corrode', 'v. i.', 'To have corrosive action; to be subject to corrosion.'),
(16778, 'Corroval', 'n.', 'A dark brown substance of vegetable origin, allied to\n   curare, and used by the natives of New Granada as an arrow poison.'),
(16779, 'Corrump', 'v. t.', 'To corrupt. See Corrupt.'),
(16780, 'Corrupt', 'a.', 'Changed from a sound to a putrid state; spoiled; tainted;\n   vitiated; unsound.'),
(16781, 'Corrupt', 'a.', 'Changed from a state of uprightness, correctness, truth,\n   etc., to a worse state; vitiated; depraved; debased; perverted; as,\n   corrupt language; corrupt judges.'),
(16782, 'Corrupt', 'a.', 'Abounding in errors; not genuine or correct; as, the text\n   of the manuscript is corrupt.'),
(16783, 'Corrupt', 'v. t.', 'To change from a sound to a putrid or putrescent state;\n   to make putrid; to putrefy.'),
(16784, 'Corrupt', 'v. t.', 'To change from good to bad; to vitiate; to deprave; to\n   pervert; to debase; to defile.'),
(16785, 'Corrupt', 'v. t.', 'To draw aside from the path of rectitude and duty; as,\n   to corrupt a judge by a bribe.'),
(16786, 'Corrupt', 'v. t.', 'To debase or render impure by alterations or\n   innovations; to falsify; as, to corrupt language; to corrupt the sacred\n   text.'),
(16787, 'Corrupt', 'v. t.', 'To waste, spoil, or consume; to make worthless.'),
(16788, 'Corrupt', 'v. i.', 'To become putrid or tainted; to putrefy; to rot.'),
(16789, 'Corrupt', 'v. i.', 'To become vitiated; to lose putity or goodness.'),
(16790, 'Corsac', 'n.', 'The corsak.'),
(16791, 'Corsage', 'n.', 'The waist or bodice of a lady\'s dress; as, a low corsage.'),
(16792, 'Corsage', 'n.', 'a flower or small arrangement of flowers worn by a person\n   as a personal ornament. Typically worn by women on special occasions\n   (as, at a ball or an anniversary celebration), a corsage may be worn\n   pinned to the chest, or tied to the wrist. It is usually larger or more\n   elaborate than a boutonniere.'),
(16793, 'Corsair', 'n.', 'A pirate; one who cruises about without authorization from\n   any government, to seize booty on sea or land.'),
(16794, 'Corsair', 'n.', 'A piratical vessel.'),
(16795, 'Corsak', 'n.', 'A small foxlike mammal (Cynalopex corsac), found in Central\n   Asia.'),
(16796, 'Corse', 'n.', 'A living body or its bulk.'),
(16797, 'Corse', 'n.', 'A corpse; the dead body of a human being.'),
(16798, 'Corselet', 'n.', 'Armor for the body, as, the body breastplate and\n   backpiece taken together; -- also, used for the entire suit of the day,\n   including breastplate and backpiece, tasset and headpiece.'),
(16799, 'Corselet', 'n.', 'The thorax of an insect.'),
(16800, 'Corset', 'n.', 'In the Middle Ages, a gown or basque of which the body was\n   close fitting, worn by both men and women.'),
(16801, 'Corset', 'n.', 'An article of dress inclosing the chest and waist worn\n   (chiefly by women) to support the body or to modify its shape; stays.'),
(16802, 'Corseted', 'imp. & p. p.', 'of Corset'),
(16803, 'Corset', 'v. t.', 'To inclose in corsets.'),
(16804, 'Corslet', 'n.', 'A corselet.'),
(16805, 'Corsned', 'n.', 'The morsel of execration; a species of ordeal consisting\n   in the eating of a piece of bread consecrated by imprecation. If the\n   suspected person ate it freely, he was pronounced innocent; but if it\n   stuck in his throat, it was considered as a proof of his guilt.'),
(16806, 'Cortege', 'n.', 'A train of attendants; a procession.'),
(16807, 'Cortes', 'n. pl.', 'The legislative assembly, composed of nobility, clergy,\n   and representatives of cities, which in Spain and in Portugal answers,\n   in some measure, to the Parliament of Great Britain.'),
(16808, 'Cortices', 'pl. ', 'of Cortex'),
(16809, 'Cortex', 'n.', 'Bark, as of a tree; hence, an outer covering.'),
(16810, 'Cortex', 'n.', 'Bark; rind; specifically, cinchona bark.'),
(16811, 'Cortex', 'n.', 'The outer or superficial part of an organ; as, the cortex\n   or gray exterior substance of the brain.'),
(16812, 'Cortical', 'a.', 'Belonging to, or consisting of, bark or rind; resembling\n   bark or rind; external; outer; superficial; as, the cortical substance\n   of the kidney.'),
(16813, 'Cortile', 'n.', 'An open internal courtyard inclosed by the walls of a\n   large dwelling house or other large and stately building.'),
(16814, 'Corundum', 'n.', 'The earth alumina, as found native in a crystalline\n   state, including sapphire, which is the fine blue variety; the oriental\n   ruby, or red sapphire; the oriental amethyst, or purple sapphire; and\n   adamantine spar, the hair-brown variety. It is the hardest substance\n   found native, next to the diamond.'),
(16815, 'Corve', 'n.', 'See Corf.'),
(16816, 'Corvee', 'n.', 'An obligation to perform certain services, as the repair of\n   roads, for the lord or sovereign.'),
(16817, 'Corven', '', 'p. p. of Carve.'),
(16818, 'Corvet', 'n.', 'Alt. of Corvette'),
(16819, 'Corvette', 'n.', 'A war vessel, ranking next below a frigate, and having\n   usually only one tier of guns; -- called in the United States navy a\n   sloop of war.'),
(16820, 'Corvetto', 'n.', 'A curvet.'),
(16821, 'Corvine', 'a.', 'Of or pertaining to the crow; crowlike.'),
(16822, 'Corybant', 'n.', 'One of the priests of Cybele in Phrygia. The rites of the\n   Corybants were accompanied by wild music, dancing, etc.'),
(16823, 'Corymb', 'n.', 'A flat-topped or convex cluster of flowers, each on its own\n   footstalk, and arising from different points of a common axis, the\n   outermost blossoms expanding first, as in the hawthorn.'),
(16824, 'Corymb', 'n.', 'Any flattish flower cluster, whatever be the order of\n   blooming, or a similar shaped cluster of fruit.'),
(16825, 'Corymbed', 'a.', 'Corymbose.'),
(16826, 'Coryphee', 'n.', 'A ballet dancer.'),
(16827, 'Coryphei', 'pl. ', 'of Corypheus'),
(16828, 'Coryza', 'n.', 'Nasal catarrh.'),
(16829, 'Cosecant', 'n.', 'The secant of the complement of an arc or angle. See\n   Illust. of Functions.'),
(16830, 'Cosen', 'v. t.', 'See Cozen.'),
(16831, 'Cosenage', 'n.', 'See Cozenage.'),
(16832, 'Cosening', 'n.', 'Anything done deceitfully, and which could not be\n   properly designated by any special name, whether belonging to contracts\n   or not.'),
(16833, 'Cosey', 'a.', 'See Cozy.'),
(16834, 'Cosher', 'v. t.', 'To levy certain exactions or tribute upon; to lodge and\n   eat at the expense of. See Coshering.'),
(16835, 'Cosher', 'v. t.', 'To treat with hospitality; to pet.'),
(16836, 'Cosherer', 'n.', 'One who coshers.'),
(16837, 'Cosier', 'n.', 'A tailor who botches his work.'),
(16838, 'Cosily', 'adv.', 'See Cozily.'),
(16839, 'Cosinage', 'n.', 'Collateral relationship or kindred by blood;\n   consanguinity.'),
(16840, 'Cosinage', 'n.', 'A writ to recover possession of an estate in lands, when\n   a stranger has entered, after the death of the grandfather\'s\n   grandfather, or other distant collateral relation.'),
(16841, 'Cosine', 'n.', 'The sine of the complement of an arc or angle. See Illust.\n   of Functions.'),
(16842, 'Cosmetic', 'a.', 'Alt. of Cosmetical'),
(16843, 'Cosmetic', 'n.', 'Any external application intended to beautify and improve\n   the complexion.'),
(16844, 'Cosmic', 'a.', 'Alt. of Cosmical'),
(16845, 'Cosmical', 'a.', 'Pertaining to the universe, and having special reference\n   to universal law or order, or to the one grand harmonious system of\n   things; hence; harmonious; orderly.'),
(16846, 'Cosmical', 'a.', 'Pertaining to the solar system as a whole, and not to the\n   earth alone.'),
(16847, 'Cosmical', 'a.', 'Characteristic of the cosmos or universe; inconceivably\n   great; vast; as, cosmic speed.'),
(16848, 'Cosmical', 'a.', 'Rising or setting with the sun; -- the opposite of\n   acronycal.'),
(16849, 'Cosmos', 'n.', 'The universe or universality of created things; -- so\n   called from the order and harmony displayed in it.'),
(16850, 'Cosmos', 'n.', 'The theory or description of the universe, as a system\n   displaying order and harmony.'),
(16851, 'Cossack', 'n.', 'One of a warlike, pastoral people, skillful as horsemen,\n   inhabiting different parts of the Russian empire and furnishing\n   valuable contingents of irregular cavalry to its armies, those of\n   Little Russia and those of the Don forming the principal divisions.'),
(16852, 'Cossas', 'n.', 'Plain India muslin, of various qualities and widths.'),
(16853, 'Cosset', 'n.', 'A lamb reared without the aid of the dam. Hence: A pet, in\n   general.'),
(16854, 'Cosset', 'v. t.', 'To treat as a pet; to fondle.'),
(16855, 'Cossic', 'a.', 'Alt. of Cossical'),
(16856, 'Cossical', 'a.', 'Of or relating to algebra; as, cossic numbers, or the\n   cossic art.'),
(16857, 'Costing', 'p. pr. & vb. n.', 'of Cost'),
(16858, 'Costa', 'n.', 'A rib of an animal or a human being.'),
(16859, 'Costa', 'n.', 'A rib or vein of a leaf, especially the midrib.'),
(16860, 'Costa', 'n.', 'The anterior rib in the wing of an insect.'),
(16861, 'Costa', 'n.', 'One of the riblike longitudinal ridges on the exterior of\n   many corals.'),
(16862, 'Costage', 'n.', 'Expense; cost.'),
(16863, 'Costal', 'a.', 'Pertaining to the ribs or the sides of the body; as, costal\n   nerves.'),
(16864, 'Costal', 'a.', 'Relating to a costa, or rib.'),
(16865, 'Costard', 'n.', 'An apple, large and round like the head.'),
(16866, 'Costard', 'n.', 'The head; -- used contemptuously.'),
(16867, 'Costate', 'a.', 'Alt. of Costated'),
(16868, 'Costated', 'a.', 'Having ribs, or the appearance of ribs; (Bot.) having one\n   or more longitudinal ribs.'),
(16869, 'Costean', 'v. i.', 'To search after lodes. See Costeaning.'),
(16870, 'Coster', 'n.', 'One who hawks about fruit, green vegetables, fish, etc.'),
(16871, 'Costive', 'a.', 'Retaining fecal matter in the bowels; having too slow a\n   motion of the bowels; constipated.'),
(16872, 'Costive', 'a.', 'Reserved; formal; close; cold.'),
(16873, 'Costive', 'a.', 'Dry and hard; impermeable; unyielding.'),
(16874, 'Costless', 'a.', 'Costing nothing.'),
(16875, 'Costlewe', 'a.', 'Costly.'),
(16876, 'Costly', 'a.', 'Of great cost; expensive; dear.'),
(16877, 'Costly', 'a.', 'Gorgeous; sumptuous.'),
(16878, 'Costmary', 'n.', 'A garden plant (Chrysanthemum Balsamita) having a strong\n   balsamic smell, and nearly allied to tansy. It is used as a pot herb\n   and salad plant and in flavoring ale and beer. Called also alecost.'),
(16879, 'Costrel', 'n.', 'A bottle of leather, earthenware, or wood, having ears by\n   which it was suspended at the side.'),
(16880, 'Costume', 'n.', 'Dress in general; esp., the distinctive style of dress of\n   a people, class, or period.'),
(16881, 'Costume', 'n.', 'Such an arrangement of accessories, as in a picture,\n   statue, poem, or play, as is appropriate to the time, place, or other\n   circumstances represented or described.'),
(16882, 'Costume', 'n.', 'A character dress, used at fancy balls or for dramatic\n   purposes.'),
(16883, 'Costumer', 'n.', 'One who makes or deals in costumes, as for theaters,\n   fancy balls, etc.'),
(16884, 'Cosurety', 'n.', 'One who is surety with another.'),
(16885, 'Cotenant', 'n.', 'A tenant in common, or a joint tenant.'),
(16886, 'Coterie', 'n.', 'A set or circle of persons who meet familiarly, as for\n   social, literary, or other purposes; a clique.'),
(16887, 'Cotgare', 'n.', 'Refuse wool.'),
(16888, 'Cothurn', 'n.', 'A buskin anciently used by tragic actors on the stage;\n   hence, tragedy in general.'),
(16889, 'Cotidal', 'a.', 'Marking an equality in the tides; having high tide at the\n   same time.'),
(16890, 'Cotillon', 'n.', 'Alt. of Cotillion'),
(16891, 'Cotinga', 'n.', 'A bird of the family Cotingidae, including numerous\n   bright-colored South American species; -- called also chatterers.'),
(16892, 'Cotise', 'n.', 'See Cottise.'),
(16893, 'Cotised', 'a.', 'See Cottised.'),
(16894, 'Cotland', 'n.', 'Land appendant to a cot or cottage, or held by a cottager\n   or cotter.'),
(16895, 'Cotquean', 'n.', 'A man who busies himself with affairs which properly\n   belong to women.'),
(16896, 'Cotquean', 'n.', 'A she-cuckold; a cucquean; a henhussy.'),
(16897, 'Cotswold', 'n.', 'An open country abounding in sheepcotes, as in the\n   Cotswold hills, in Gloucestershire, England.'),
(16898, 'Cottage', 'n.', 'A small house; a cot; a hut.'),
(16899, 'Cottaged', 'a.', 'Set or covered with cottages.'),
(16900, 'Cottager', 'n.', 'One who lives in a cottage.'),
(16901, 'Cottager', 'n.', 'One who lives on the common, without paying any rent, or\n   having land of his own.'),
(16902, 'Cotter', 'n.', 'Alt. of Cottar'),
(16903, 'Cottar', 'n.', 'A cottager; a cottier.'),
(16904, 'Cotter', 'n.', 'A piece of wood or metal, commonly wedge-shaped, used for\n   fastening together parts of a machine or structure. It is driven into\n   an opening through one or all of the parts. [See Illust.] In the United\n   States a cotter is commonly called a key.'),
(16905, 'Cotter', 'n.', 'A toggle.'),
(16906, 'Cotter', 'v. t.', 'To fasten with a cotter.'),
(16907, 'Cottier', 'n.', 'In Great Britain and Ireland, a person who hires a small\n   cottage, with or without a plot of land. Cottiers commonly aid in the\n   work of the landlord\'s farm.'),
(16908, 'Cottise', 'n.', 'A diminutive of the bendlet, containing one half its area\n   or one quarter the area of the bend. When a single cottise is used\n   alone it is often called a cost. See also Couple-close.'),
(16909, 'Cottised', 'a.', 'Set between two cottises, -- said of a bend; or between\n   two barrulets, -- said of a bar or fess.'),
(16910, 'Cottoid', 'a.', 'Like a fish of the genus Cottus.'),
(16911, 'Cottoid', 'n.', 'A fish belonging to, or resembling, the genus Cottus. See\n   Sculpin.'),
(16912, 'Cotton', 'n.', 'A soft, downy substance, resembling fine wool, consisting\n   of the unicellular twisted hairs which grow on the seeds of the cotton\n   plant. Long-staple cotton has a fiber sometimes almost two inches long;\n   short-staple, from two thirds of an inch to an inch and a half.'),
(16913, 'Cotton', 'n.', 'The cotton plant. See Cotten plant, below.'),
(16914, 'Cotton', 'n.', 'Cloth made of cotton.'),
(16915, 'Cotton', 'v. i.', 'To rise with a regular nap, as cloth does.'),
(16916, 'Cotton', 'v. i.', 'To go on prosperously; to succeed.'),
(16917, 'Cotton', 'v. i.', 'To unite; to agree; to make friends; -- usually followed\n   by with.'),
(16918, 'Cotton', 'v. i.', 'To take a liking to; to stick to one as cotton; -- used\n   with to.'),
(16919, 'Cottony', 'a.', 'Covered with hairs or pubescence, like cotton; downy;\n   nappy; woolly.'),
(16920, 'Cottony', 'a.', 'Of or pertaining to cotton; resembling cotton in\n   appearance or character; soft, like cotton.'),
(16921, 'Cottrel', 'n.', 'A trammel, or hook to support a pot over a fire.'),
(16922, 'Cotyla', 'n.', 'Alt. of Cotyle'),
(16923, 'Cotyle', 'n.', 'A cuplike cavity or organ. Same as Acetabulum.'),
(16924, 'Cotyloid', 'a.', 'Shaped like a cup; as, the cotyloid cavity, which\n   receives the head of the thigh bone.'),
(16925, 'Cotyloid', 'a.', 'Pertaining to a cotyloid cavity; as, the cotyloid\n   ligament, or notch.'),
(16926, 'Coucal', 'n.', 'A large, Old World, ground cuckoo of the genus Centropus,\n   of several species.'),
(16927, 'Couched', 'imp. & p. p.', 'of Couch'),
(16928, 'Couching', 'p. pr. & vb. n.', 'of Couch'),
(16929, 'Couch', 'v. t.', 'To lay upon a bed or other resting place.'),
(16930, 'Couch', 'v. t.', 'To arrange or dispose as in a bed; -- sometimes followed\n   by the reflexive pronoun.'),
(16931, 'Couch', 'v. t.', 'To lay or deposit in a bed or layer; to bed.'),
(16932, 'Couch', 'v. t.', 'To transfer (as sheets of partly dried pulp) from the\n   wire cloth mold to a felt blanket, for further drying.'),
(16933, 'Couch', 'v. t.', 'To conceal; to include or involve darkly.'),
(16934, 'Couch', 'v. t.', 'To arrange; to place; to inlay.'),
(16935, 'Couch', 'v. t.', 'To put into some form of language; to express; to phrase;\n   -- used with in and under.'),
(16936, 'Couch', 'v. t.', 'To treat by pushing down or displacing the opaque lens\n   with a needle; as, to couch a cataract.'),
(16937, 'Couch', 'v. i.', 'To lie down or recline, as on a bed or other place of\n   rest; to repose; to lie.'),
(16938, 'Couch', 'v. i.', 'To lie down for concealment; to hide; to be concealed; to\n   be included or involved darkly.'),
(16939, 'Couch', 'v. i.', 'To bend the body, as in reverence, pain, labor, etc.; to\n   stoop; to crouch.'),
(16940, 'Couch', 'v. t.', 'A bed or place for repose or sleep; particularly, in the\n   United States, a lounge.'),
(16941, 'Couch', 'v. t.', 'Any place for repose, as the lair of a beast, etc.'),
(16942, 'Couch', 'v. t.', 'A mass of steeped barley spread upon a floor to\n   germinate, in malting; or the floor occupied by the barley; as, couch\n   of malt.'),
(16943, 'Couch', 'v. t.', 'A preliminary layer, as of color, size, etc.'),
(16944, 'Couchant', 'v. t.', 'Lying down with head erect; squatting.'),
(16945, 'Couchant', 'v. t.', 'Lying down with the head raised, which distinguishes\n   the posture of couchant from that of dormant, or sleeping; -- said of a\n   lion or other beast.'),
(16946, 'Couche', 'v. t.', 'Not erect; inclined; -- said of anything that is usually\n   erect, as an escutcheon.'),
(16947, 'Couche', 'v. t.', 'Lying on its side; thus, a chevron couche is one which\n   emerges from one side of the escutcheon and has its apex on the\n   opposite side, or at the fess point.'),
(16948, 'Couched', 'a.', 'Same as Couch/.'),
(16949, 'Couchee', 'v. t.', 'A reception held at the time of going to bed, as by a\n   sovereign or great prince.'),
(16950, 'Coucher', 'n.', 'One who couches.'),
(16951, 'Coucher', 'n.', 'One who couches paper.'),
(16952, 'Coucher', 'n.', 'A factor or agent resident in a country for traffic.'),
(16953, 'Coucher', 'n.', 'The book in which a corporation or other body registers\n   its particular acts.'),
(16954, 'Couching', 'n.', 'The operation of putting down or displacing the opaque\n   lens in cataract.'),
(16955, 'Couching', 'n.', 'Embroidering by laying the materials upon the surface of\n   the foundation, instead of drawing them through.'),
(16956, 'Coudee', 'n.', 'A measure of length; the distance from the elbow to the end\n   of the middle finger; a cubit.'),
(16957, 'Cougar', 'n.', 'An American feline quadruped (Felis concolor), resembling\n   the African panther in size and habits. Its color is tawny, without\n   spots; hence writers often called it the American lion. Called also\n   puma, panther, mountain lion, and catamount. See Puma.'),
(16958, 'Coughed', 'imp. & p. p.', 'of Cough'),
(16959, 'Coughing', 'p. pr. & vb. n.', 'of Cough'),
(16960, 'Cough', 'v. i.', 'To expel air, or obstructing or irritating matter, from\n   the lungs or air passages, in a noisy and violent manner.'),
(16961, 'Cough', 'v. t.', 'To expel from the lungs or air passages by coughing; --\n   followed by up; as, to cough up phlegm.'),
(16962, 'Cough', 'v. t.', 'To bring to a specified state by coughing; as, he coughed\n   himself hoarse.'),
(16963, 'Cough', 'v. i.', 'A sudden, noisy, and violent expulsion of air from the\n   chest, caused by irritation in the air passages, or by the reflex\n   action of nervous or gastric disorder, etc.'),
(16964, 'Cough', 'v. i.', 'The more or less frequent repetition of coughing,\n   constituting a symptom of disease.'),
(16965, 'Cougher', 'n.', 'One who coughs.'),
(16966, 'Couhage', 'n.', 'See Cowhage.'),
(16967, 'Could', 'imp.', 'Was, should be, or would be, able, capable, or\n   susceptible. Used as an auxiliary, in the past tense or in the\n   conditional present.'),
(16968, 'Coulee', 'n.', 'A stream'),
(16969, 'Coulee', 'n.', 'a stream of lava. Also, in the Western United States, the\n   bed of a stream, even if dry, when deep and having inclined sides;\n   distinguished from a caon, which has precipitous sides.'),
(16970, 'Coulisse', 'n.', 'A piece of timber having a groove in which something\n   glides.'),
(16971, 'Coulisse', 'n.', 'One of the side scenes of the stage in a theater, or the\n   space included between the side scenes.'),
(16972, 'Couloir', 'n.', 'A deep gorge; a gully.'),
(16973, 'Couloir', 'n.', 'A dredging machine for excavating canals, etc.'),
(16974, 'Coulomb', 'n.', 'The standard unit of quantity in electrical measurements.\n   It is the quantity of electricity conveyed in one second by the current\n   produced by an electro-motive force of one volt acting in a circuit\n   having a resistance of one ohm, or the quantity transferred by one\n   ampere in one second. Formerly called weber.'),
(16975, 'Coulter', 'n.', 'Same as Colter.'),
(16976, 'Coumaric', 'a.', 'Relating to, derived from, or like, the Dipterix odorata,\n   a tree of Guiana.'),
(16977, 'Coumarin', 'n.', 'The concrete essence of the tonka bean, the fruit of\n   Dipterix (formerly Coumarouna) odorata and consisting essentially of\n   coumarin proper, which is a white crystalline substance, C9H6O2, of\n   vanilla-like odor, regarded as an anhydride of coumaric acid, and used\n   in flavoring. Coumarin in also made artificially.'),
(16978, 'Council', 'n.', 'An assembly of men summoned or convened for consultation,\n   deliberation, or advice; as, a council of physicians for consultation\n   in a critical case.'),
(16979, 'Council', 'n.', 'A body of man elected or appointed to constitute an\n   advisory or a legislative assembly; as, a governor\'s council; a city\n   council.'),
(16980, 'Council', 'n.', 'Act of deliberating; deliberation; consultation.'),
(16981, 'Co-une', 'v. t.', 'To combine or unite.'),
(16982, 'Co-unite', 'v. t.', 'To unite.'),
(16983, 'Co-unite', 'a.', 'United closely with another.'),
(16984, 'Counsel', 'n.', 'Interchange of opinions; mutual advising; consultation.'),
(16985, 'Counsel', 'n.', 'Examination of consequences; exercise of deliberate\n   judgment; prudence.'),
(16986, 'Counsel', 'n.', 'Result of consultation; advice; instruction.'),
(16987, 'Counsel', 'n.', 'Deliberate purpose; design; intent; scheme; plan.'),
(16988, 'Counsel', 'n.', 'A secret opinion or purpose; a private matter.'),
(16989, 'Counsel', 'n.', 'One who gives advice, especially in legal matters; one\n   professionally engaged in the trial or management of a cause in court;\n   also, collectively, the legal advocates united in the management of a\n   case; as, the defendant has able counsel.'),
(16990, 'Counsel', 'v. t.', 'To give advice to; to advice, admonish, or instruct, as\n   a person.'),
(16991, 'Counsel', 'v. t.', 'To advise or recommend, as an act or course.'),
(16992, 'Counted', 'imp. & p. p.', 'of Count'),
(16993, 'Counting', 'p. pr. & vb. n.', 'of Count'),
(16994, 'Count', 'v. t.', 'To tell or name one by one, or by groups, for the purpose\n   of ascertaining the whole number of units in a collection; to number;\n   to enumerate; to compute; to reckon.'),
(16995, 'Count', 'v. t.', 'To place to an account; to ascribe or impute; to consider\n   or esteem as belonging.'),
(16996, 'Count', 'v. t.', 'To esteem; to account; to reckon; to think, judge, or\n   consider.'),
(16997, 'Count', 'v. i.', 'To number or be counted; to possess value or carry\n   weight; hence, to increase or add to the strength or influence of some\n   party or interest; as, every vote counts; accidents count for nothing.'),
(16998, 'Count', 'v. i.', 'To reckon; to rely; to depend; -- with on or upon.'),
(16999, 'Count', 'v. i.', 'To take account or note; -- with'),
(17000, 'Count', 'v. i.', 'To plead orally; to argue a matter in court; to recite a\n   count.'),
(17001, 'Count', 'v. t.', 'The act of numbering; reckoning; also, the number\n   ascertained by counting.'),
(17002, 'Count', 'v. t.', 'An object of interest or account; value; estimation.'),
(17003, 'Count', 'v. t.', 'A formal statement of the plaintiff\'s case in court; in a\n   more technical and correct sense, a particular allegation or charge in\n   a declaration or indictment, separately setting forth the cause of\n   action or prosecution.'),
(17004, 'Count', 'n.', 'A nobleman on the continent of Europe, equal in rank to an\n   English earl.'),
(17005, 'Counter', 'adv.', 'A prefix meaning contrary, opposite, in opposition; as,\n   counteract, counterbalance, countercheck. See Counter, adv. & a.'),
(17006, 'Counter', 'v. t.', 'One who counts, or reckons up; a calculator; a\n   reckoner.'),
(17007, 'Counter', 'v. t.', 'A piece of metal, ivory, wood, or bone, used in\n   reckoning, in keeping account of games, etc.'),
(17008, 'Counter', 'v. t.', 'Money; coin; -- used in contempt.'),
(17009, 'Counter', 'v. t.', 'A prison; either of two prisons formerly in London.'),
(17010, 'Counter', 'v. t.', 'A telltale; a contrivance attached to an engine,\n   printing press, or other machine, for the purpose of counting the\n   revolutions or the pulsations.'),
(17011, 'Counter', 'v. t.', 'A table or board on which money is counted and over\n   which business is transacted; a long, narrow table or bench, on which\n   goods are laid for examination by purchasers, or on which they are\n   weighed or measured.'),
(17012, 'Counter', 'adv.', 'Contrary; in opposition; in an opposite direction;\n   contrariwise; -- used chiefly with run or go.'),
(17013, 'Counter', 'adv.', 'In the wrong way; contrary to the right course; as, a\n   hound that runs counter.'),
(17014, 'Counter', 'adv.', 'At or against the front or face.'),
(17015, 'Counter', 'a.', 'Contrary; opposite; contrasted; opposed; adverse;\n   antagonistic; as, a counter current; a counter revolution; a counter\n   poison; a counter agent; counter fugue.'),
(17016, 'Counter', 'adv.', 'The after part of a vessel\'s body, from the water line\n   to the stern, -- below and somewhat forward of the stern proper.'),
(17017, 'Counter', 'adv.', 'Same as Contra. Formerly used to designate any under\n   part which served for contrast to a principal part, but now used as\n   equivalent to counter tenor.'),
(17018, 'Counter', 'adv.', 'The breast, or that part of a horse between the\n   shoulders and under the neck.'),
(17019, 'Counter', 'adv.', 'The back leather or heel part of a boot.'),
(17020, 'Counter', 'n.', 'An encounter.'),
(17021, 'Counter', 'v. i.', 'To return a blow while receiving one, as in boxing.'),
(17022, 'Countess', 'n.', 'The wife of an earl in the British peerage, or of a count\n   in the Continental nobility; also, a lady possessed of the same dignity\n   in her own right. See the Note under Count.'),
(17023, 'Countor', 'v. t.', 'An advocate or professional pleader; one who counted\n   for his client, that is, orally pleaded his cause.'),
(17024, 'Countour', 'n.', 'Alt. of Countourhouse'),
(17025, 'Countre-', '', 'Same as prefix Counter-.'),
(17026, 'Country', 'adv.', 'A tract of land; a region; the territory of an\n   independent nation; (as distinguished from any other region, and with a\n   personal pronoun) the region of one\'s birth, permanent residence, or\n   citizenship.'),
(17027, 'Country', 'adv.', 'Rural regions, as opposed to a city or town.'),
(17028, 'Country', 'adv.', 'The inhabitants or people of a state or a region; the\n   populace; the public. Hence: (a) One\'s constituents. (b) The whole body\n   of the electors of state; as, to dissolve Parliament and appeal to the\n   country.'),
(17029, 'Country', 'adv.', 'A jury, as representing the citizens of a country.'),
(17030, 'Country', 'adv.', 'The inhabitants of the district from which a jury is\n   drawn.'),
(17031, 'Country', 'adv.', 'The rock through which a vein runs.'),
(17032, 'Country', 'a.', 'Pertaining to the regions remote from a city; rural;\n   rustic; as, a country life; a country town; the country party, as\n   opposed to city.'),
(17033, 'Country', 'a.', 'Destitute of refinement; rude; unpolished; rustic; not\n   urbane; as, country manners.'),
(17034, 'Country', 'a.', 'Pertaining, or peculiar, to one\'s own country.'),
(17035, 'Counties', 'pl. ', 'of County'),
(17036, 'County', 'n.', 'An earldom; the domain of a count or earl.'),
(17037, 'County', 'n.', 'A circuit or particular portion of a state or kingdom,\n   separated from the rest of the territory, for certain purposes in the\n   administration of justice and public affairs; -- called also a shire.\n   See Shire.'),
(17038, 'County', 'n.', 'A count; an earl or lord.'),
(17039, 'Coupable', 'a.', 'Culpable.'),
(17040, 'Coupe', 'n.', 'The front compartment of a French diligence; also, the front\n   compartment (usually for three persons) of a car or carriage on British\n   railways.'),
(17041, 'Coupe', 'n.', 'A four-wheeled close carriage for two persons inside, with\n   an outside seat for the driver; -- so called because giving the\n   appearance of a larger carriage cut off.'),
(17042, 'Couped', 'a.', 'Cut off smoothly, as distinguished from erased; -- used\n   especially for the head or limb of an animal. See Erased.'),
(17043, 'Coupee', 'n.', 'A motion in dancing, when one leg is a little bent, and\n   raised from the floor, and with the other a forward motion is made.'),
(17044, 'Couple', 'a.', 'That which joins or links two things together; a bond or\n   tie; a coupler.'),
(17045, 'Couple', 'a.', 'Two of the same kind connected or considered together; a\n   pair; a brace.'),
(17046, 'Couple', 'a.', 'A male and female associated together; esp., a man and\n   woman who are married or betrothed.'),
(17047, 'Couple', 'a.', 'See Couple-close.'),
(17048, 'Couple', 'a.', 'One of the pairs of plates of two metals which compose a\n   voltaic battery; -- called a voltaic couple or galvanic couple.'),
(17049, 'Couple', 'a.', 'Two rotations, movements, etc., which are equal in amount\n   but opposite in direction, and acting along parallel lines or around\n   parallel axes.'),
(17050, 'Coupled', 'imp. & p. p.', 'of Couple'),
(17051, 'Coupling', 'p. pr. & vb. n.', 'of Couple'),
(17052, 'Couple', 'v.', 'To link or tie, as one thing to another; to connect or\n   fasten together; to join.'),
(17053, 'Couple', 'v.', 'To join in wedlock; to marry.'),
(17054, 'Couple', 'v. i.', 'To come together as male and female; to copulate.'),
(17055, 'Coupler', 'n.', 'One who couples; that which couples, as a link, ring, or\n   shackle, to connect cars.'),
(17056, 'Couplet', 'n.', 'Two taken together; a pair or couple; especially two lines\n   of verse that rhyme with each other.'),
(17057, 'Coupling', 'n.', 'The act of bringing or coming together; connection;\n   sexual union.'),
(17058, 'Coupling', 'n.', 'A device or contrivance which serves to couple or connect\n   adjacent parts or objects; as, a belt coupling, which connects the ends\n   of a belt; a car coupling, which connects the cars in a train; a shaft\n   coupling, which connects the ends of shafts.'),
(17059, 'Coupon', 'n.', 'A certificate of interest due, printed at the bottom of\n   transferable bonds (state, railroad, etc.), given for a term of years,\n   designed to be cut off and presented for payment when the interest is\n   due; an interest warrant.'),
(17060, 'Coupon', 'n.', 'A section of a ticket, showing the holder to be entitled to\n   some specified accomodation or service, as to a passage over a\n   designated line of travel, a particular seat in a theater, or the like.'),
(17061, 'Coupure', 'n.', 'A passage cut through the glacis to facilitate sallies by\n   the besieged.'),
(17062, 'Courage', 'n.', 'The heart; spirit; temper; disposition.'),
(17063, 'Courage', 'n.', 'Heart; inclination; desire; will.'),
(17064, 'Courage', 'n.', 'That quality of mind which enables one to encounter danger\n   and difficulties with firmness, or without fear, or fainting of heart;\n   valor; boldness; resolution.'),
(17065, 'Couage', 'v. t.', 'To inspire with courage.'),
(17066, 'Courant', 'a.', 'Represented as running; -- said of a beast borne in a coat\n   of arms.'),
(17067, 'Courant', 'p. pr.', 'A piece of music in triple time; also, a lively dance;\n   a coranto.'),
(17068, 'Courant', 'p. pr.', 'A circulating gazette of news; a newspaper.'),
(17069, 'Couranto', 'n.', 'A sprightly dance; a coranto; a courant.'),
(17070, 'Courap', 'n.', 'A skin disease, common in India, in which there is\n   perpetual itching and eruption, esp. of the groin, breast, armpits, and\n   face.'),
(17071, 'Courb', 'a.', 'Curved; rounded.'),
(17072, 'Courb', 'v. i.', 'To bend; to stop; to bow.'),
(17073, 'Courche', 'n.', 'A square piece of linen used formerly by women instead of\n   a cap; a kerchief.'),
(17074, 'Courier', 'n.', 'A messenger sent with haste to convey letters or\n   dispatches, usually on public business.'),
(17075, 'Courier', 'n.', 'An attendant on travelers, whose business it is to make\n   arrangements for their convenience at hotels and on the way.'),
(17076, 'Courlan', 'n.', 'A South American bird, of the genus Aramus, allied to the\n   rails.'),
(17077, 'Course', 'n.', 'The act of moving from one point to another; progress;\n   passage.'),
(17078, 'Course', 'n.', 'The ground or path traversed; track; way.'),
(17079, 'Course', 'n.', 'Motion, considered as to its general or resultant direction\n   or to its goal; line progress or advance.'),
(17080, 'Course', 'n.', 'Progress from point to point without change of direction;\n   any part of a progress from one place to another, which is in a\n   straight line, or on one direction; as, a ship in a long voyage makes\n   many courses; a course measured by a surveyor between two stations;\n   also, a progress without interruption or rest; a heat; as, one course\n   of a race.'),
(17081, 'Course', 'n.', 'Motion considered with reference to manner; or derly\n   progress; procedure in a certain line of thought or action; as, the\n   course of an argument.'),
(17082, 'Course', 'n.', 'Customary or established sequence of events; recurrence of\n   events according to natural laws.'),
(17083, 'Course', 'n.', 'Method of procedure; manner or way of conducting; conduct;\n   behavior.'),
(17084, 'Course', 'n.', 'A series of motions or acts arranged in order; a succession\n   of acts or practices connectedly followed; as, a course of medicine; a\n   course of lectures on chemistry.'),
(17085, 'Course', 'n.', 'The succession of one to another in office or duty; order;\n   turn.'),
(17086, 'Course', 'n.', 'That part of a meal served at one time, with its\n   accompaniments.'),
(17087, 'Course', 'n.', 'A continuous level range of brick or stones of the same\n   height throughout the face or faces of a building.'),
(17088, 'Course', 'n.', 'The lowest sail on any mast of a square-rigged vessel; as,\n   the fore course, main course, etc.'),
(17089, 'Course', 'n.', 'The menses.'),
(17090, 'Coursed', 'imp. & p. p.', 'of Course'),
(17091, 'Coursing', 'p. pr. & vb. n.', 'of Course'),
(17092, 'Course', 'v. t.', 'To run, hunt, or chase after; to follow hard upon; to\n   pursue.'),
(17093, 'Course', 'v. t.', 'To cause to chase after or pursue game; as, to course\n   greyhounds after deer.'),
(17094, 'Course', 'v. t.', 'To run through or over.'),
(17095, 'Course', 'v. i.', 'To run as in a race, or in hunting; to pursue the sport\n   of coursing; as, the sportsmen coursed over the flats of Lancashire.'),
(17096, 'Course', 'v. i.', 'To move with speed; to race; as, the blood courses\n   through the veins.'),
(17097, 'Coursed', 'a.', 'Hunted; as, a coursed hare.'),
(17098, 'Coursed', 'a.', 'Arranged in courses; as, coursed masonry.'),
(17099, 'Courser', 'n.', 'One who courses or hunts.'),
(17100, 'Courser', 'n.', 'A swift or spirited horse; a racer or a war horse; a\n   charger.'),
(17101, 'Courser', 'n.', 'A grallatorial bird of Europe (Cursorius cursor),\n   remarkable for its speed in running. Sometimes, in a wider sense,\n   applied to running birds of the Ostrich family.'),
(17102, 'Coursey', 'n.', 'A space in the galley; a part of the hatches.'),
(17103, 'Coursing', 'n.', 'The pursuit or running game with dogs that follow by\n   sight instead of by scent.'),
(17104, 'Court', 'n.', 'An inclosed space; a courtyard; an uncovered area shut in by\n   the walls of a building, or by different building; also, a space\n   opening from a street and nearly surrounded by houses; a blind alley.'),
(17105, 'Court', 'n.', 'The residence of a sovereign, prince, nobleman, or ether\n   dignitary; a palace.'),
(17106, 'Court', 'n.', 'The collective body of persons composing the retinue of a\n   sovereign or person high in authority; all the surroundings of a\n   sovereign in his regal state.'),
(17107, 'Court', 'n.', 'Any formal assembling of the retinue of a sovereign; as, to\n   hold a court.'),
(17108, 'Court', 'n.', 'Attention directed to a person in power; conduct or address\n   designed to gain favor; courtliness of manners; civility; compliment;\n   flattery.'),
(17109, 'Court', 'n.', 'The hall, chamber, or place, where justice is administered.'),
(17110, 'Court', 'n.', 'The persons officially assembled under authority of law, at\n   the appropriate time and place, for the administration of justice; an\n   official assembly, legally met together for the transaction of judicial\n   business; a judge or judges sitting for the hearing or trial of causes.'),
(17111, 'Court', 'n.', 'A tribunal established for the administration of justice.'),
(17112, 'Court', 'n.', 'The judge or judges; as distinguished from the counsel or\n   jury, or both.'),
(17113, 'Court', 'n.', 'The session of a judicial assembly.'),
(17114, 'Court', 'n.', 'Any jurisdiction, civil, military, or ecclesiastical.'),
(17115, 'Court', 'n.', 'A place arranged for playing the game of tennis; also, one\n   of the divisions of a tennis court.'),
(17116, 'Courted', 'imp. & p. p.', 'of Court'),
(17117, 'Courting', 'p. pr. & vb. n.', 'of Court'),
(17118, 'Court', 'v. t.', 'To endeavor to gain the favor of by attention or\n   flattery; to try to ingratiate one\'s self with.'),
(17119, 'Court', 'v. t.', 'To endeavor to gain the affections of; to seek in\n   marriage; to woo.'),
(17120, 'Court', 'v. t.', 'To attempt to gain; to solicit; to seek.'),
(17121, 'Court', 'v. t.', 'To invite by attractions; to allure; to attract.'),
(17122, 'Court', 'v. i.', 'To play the lover; to woo; as, to go courting.'),
(17123, 'Courtepy', 'n.', 'A short coat of coarse cloth.'),
(17124, 'Courter', 'n.', 'One who courts; one who plays the lover, or who solicits\n   in marriage; one who flatters and cajoles.'),
(17125, 'Courtesy', 'n.', 'Politeness; civility; urbanity; courtliness.'),
(17126, 'Courtesy', 'n.', 'An act of civility or respect; an act of kindness or\n   favor performed with politeness.'),
(17127, 'Courtesy', 'n.', 'Favor or indulgence, as distinguished from right; as, a\n   title given one by courtesy.'),
(17128, 'Courtesy', 'n.', 'An act of civility, respect, or reverence, made by women,\n   consisting of a slight depression or dropping of the body, with bending\n   of the knees.'),
(17129, 'Courtesy', 'v. i.', 'To make a respectful salutation or movement of\n   respect; esp. (with reference to women), to bow the body slightly, with\n   bending of the knes.'),
(17130, 'Courtesy', 'v. t.', 'To treat with civility.'),
(17131, 'Courtier', 'n.', 'One who is in attendance at the court of a prince; one\n   who has an appointment at court.'),
(17132, 'Courtier', 'n.', 'One who courts or solicits favor; one who flatters.'),
(17133, 'Courtly', 'a.', 'Relating or belonging to a court.'),
(17134, 'Courtly', 'a.', 'Elegant; polite; courtlike; flattering.'),
(17135, 'Courtly', 'a.', 'Disposed to favor the great; favoring the policy or party\n   of the court; obsequious.'),
(17136, 'Courtly', 'adv.', 'In the manner of courts; politely; gracefully;\n   elegantly.'),
(17137, 'Couscous', 'n.', 'A kind of food used by the natives of Western Africa,\n   made of millet flour with flesh, and leaves of the baobab; -- called\n   also lalo.'),
(17138, 'Cousin', 'n.', 'One collaterally related more remotely than a brother or\n   sister; especially, the son or daughter of an uncle or aunt.'),
(17139, 'Cousin', 'n.', 'A title formerly given by a king to a nobleman,\n   particularly to those of the council. In English writs, etc., issued by\n   the crown, it signifies any earl.'),
(17140, 'Cousin', 'n.', 'Allied; akin.'),
(17141, 'Cousinly', 'a.', 'Like or becoming a cousin.'),
(17142, 'Cousinry', 'n.', 'A body or collection of cousins; the whole number of\n   persons who stand in the relation of cousins to a given person or\n   persons.'),
(17143, 'Couteau', 'n.', 'A knife; a dagger.'),
(17144, 'Couth', 'imp. & p. p.', 'Could; was able; knew or known; understood.'),
(17145, 'Couvade', 'n.', 'A custom, among certain barbarous tribes, that when a\n   woman gives birth to a child her husband takes to his bed, as if ill.'),
(17146, 'Coved', 'imp. & p. p.', 'of Cove'),
(17147, 'Coving', 'p. pr. & vb. n.', 'of Cove'),
(17148, 'Covenant', 'n.', 'A mutual agreement of two or more persons or parties, or\n   one of the stipulations in such an agreement.'),
(17149, 'Covenant', 'n.', 'An agreement made by the Scottish Parliament in 1638, and\n   by the English Parliament in 1643, to preserve the reformed religion in\n   Scotland, and to extirpate popery and prelacy; -- usually called the\n   \"Solemn League and Covenant.\"'),
(17150, 'Covenant', 'n.', 'The promises of God as revealed in the Scriptures,\n   conditioned on certain terms on the part of man, as obedience,\n   repentance, faith, etc.'),
(17151, 'Covenant', 'n.', 'A solemn compact between members of a church to maintain\n   its faith, discipline, etc.'),
(17152, 'Covenant', 'n.', 'An undertaking, on sufficient consideration, in writing\n   and under seal, to do or to refrain from some act or thing; a contract;\n   a stipulation; also, the document or writing containing the terms of\n   agreement.'),
(17153, 'Covenant', 'n.', 'A form of action for the violation of a promise or\n   contract under seal.'),
(17154, 'Covenant', 'v. i.', 'To agree (with); to enter into a formal agreement; to\n   bind one\'s self by contract; to make a stipulation.'),
(17155, 'Covenant', 'v. t.', 'To grant or promise by covenant.'),
(17156, 'Covenous', 'a.', 'See Covinous, and Covin.'),
(17157, 'Covent', 'n.', 'A convent or monastery.'),
(17158, 'Coventry', 'n.', 'A town in the county of Warwick, England.'),
(17159, 'Covered', 'imp. & p. p.', 'of Cover'),
(17160, 'Covering', 'p. pr. & vb. n.', 'of Cover'),
(17161, 'Cover', 'v. t.', 'To overspread the surface of (one thing) with another;\n   as, to cover wood with paint or lacquer; to cover a table with a cloth.'),
(17162, 'Cover', 'v. t.', 'To envelop; to clothe, as with a mantle or cloak.'),
(17163, 'Cover', 'v. t.', 'To invest (one\'s self with something); to bring upon\n   (one\'s self); as, he covered himself with glory.'),
(17164, 'Cover', 'v. t.', 'To hide sight; to conceal; to cloak; as, the enemy were\n   covered from our sight by the woods.'),
(17165, 'Cover', 'v. t.', 'To brood or sit on; to incubate.'),
(17166, 'Cover', 'v. t.', 'To shelter, as from evil or danger; to protect; to\n   defend; as, the cavalry covered the retreat.'),
(17167, 'Cover', 'v. t.', 'To remove from remembrance; to put away; to remit.'),
(17168, 'Cover', 'v. t.', 'To extend over; to be sufficient for; to comprehend,\n   include, or embrace; to account for or solve; to counterbalance; as, a\n   mortgage which fully covers a sum loaned on it; a law which covers all\n   possible cases of a crime; receipts than do not cover expenses.'),
(17169, 'Cover', 'v. t.', 'To put the usual covering or headdress on.'),
(17170, 'Cover', 'v. t.', 'To copulate with (a female); to serve; as, a horse covers\n   a mare; -- said of the male.'),
(17171, 'Cover', 'n.', 'Anything which is laid, set, or spread, upon, about, or\n   over, another thing; an envelope; a lid; as, the cover of a book.'),
(17172, 'Cover', 'n.', 'Anything which veils or conceals; a screen; disguise; a\n   cloak.'),
(17173, 'Cover', 'n.', 'Shelter; protection; as, the troops fought under cover of\n   the batteries; the woods afforded a good cover.'),
(17174, 'Cover', 'n.', 'The woods, underbrush, etc., which shelter and conceal game;\n   covert; as, to beat a cover; to ride to cover.'),
(17175, 'Cover', 'n.', 'The lap of a slide valve.'),
(17176, 'Cover', 'n.', 'A tablecloth, and the other table furniture; esp., the table\n   furniture for the use of one person at a meal; as, covers were laid for\n   fifty guests.'),
(17177, 'Cover', 'v. i.', 'To spread a table for a meal; to prepare a banquet.'),
(17178, 'Covercle', 'n.', 'A small cover; a lid.'),
(17179, 'Covered', 'a.', 'Under cover; screened; sheltered; not exposed; hidden.'),
(17180, 'Coverer', 'n.', 'One who, or that which, covers.'),
(17181, 'Covering', 'n.', 'Anything which covers or conceals, as a roof, a screen, a\n   wrapper, clothing, etc.'),
(17182, 'Coverlet', 'n.', 'The uppermost cover of a bed or of any piece of\n   furniture.'),
(17183, 'Coverlid', 'n.', 'A coverlet.'),
(17184, 'Covert', 'v. t.', 'Covered over; private; hid; secret; disguised.'),
(17185, 'Covert', 'v. t.', 'Sheltered; not open or exposed; retired; protected; as,\n   a covert nook.'),
(17186, 'Covert', 'v. t.', 'Under cover, authority or protection; as, a feme covert,\n   a married woman who is considered as being under the protection and\n   control of her husband.'),
(17187, 'Covert', 'a.', 'A place that covers and protects; a shelter; a defense.'),
(17188, 'Covert', 'a.', 'One of the special feathers covering the bases of the\n   quills of the wings and tail of a bird. See Illust. of Bird.'),
(17189, 'Covertly', 'adv.', 'Secretly; in private; insidiously.'),
(17190, 'Covered', 'imp. & p. p.', 'of Covet'),
(17191, 'Coveting', 'p. pr. & vb. n.', 'of Covet'),
(17192, 'Covet', 'v. t.', 'To wish for with eagerness; to desire possession of; --\n   used in a good sense.'),
(17193, 'Covet', 'v. t.', 'To long for inordinately or unlawfully; to hanker after\n   (something forbidden).'),
(17194, 'Covet', 'v. i.', 'To have or indulge inordinate desire.'),
(17195, 'Coveter', 'n.', 'One who covets.'),
(17196, 'Covetise', 'v. t.', 'Avarice.'),
(17197, 'Covetous', 'v. t.', 'Very desirous; eager to obtain; -- used in a good\n   sense.'),
(17198, 'Covetous', 'v. t.', 'Inordinately desirous; excessively eager to obtain and\n   possess (esp. money); avaricious; -- in a bad sense.'),
(17199, 'Covey', 'n.', 'A brood or hatch of birds; an old bird with her brood of\n   young; hence, a small flock or number of birds together; -- said of\n   game; as, a covey of partridges.'),
(17200, 'Covey', 'n.', 'A company; a bevy; as, a covey of girls.'),
(17201, 'Covey', 'v. i.', 'To brood; to incubate.'),
(17202, 'Covey', 'n.', 'A pantry.'),
(17203, 'Covin', 'n.', 'A collusive agreement between two or more persons to\n   prejudice a third.'),
(17204, 'Covin', 'n.', 'Deceit; fraud; artifice.'),
(17205, 'Covinous', 'a.', 'Deceitful; collusive; fraudulent; dishonest.'),
(17206, 'Cowed', 'imp. & p. p.', 'of Cow'),
(17207, 'Cowing', 'p. pr. & vb. n.', 'of Cow'),
(17208, 'Cowage', 'n.', 'See Cowhage.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(17209, 'Cowan', 'n.', 'One who works as a mason without having served a regular\n   apprenticeship.'),
(17210, 'Coward', 'a.', 'Borne in the escutcheon with his tail doubled between his\n   legs; -- said of a lion.'),
(17211, 'Coward', 'a.', 'Destitute of courage; timid; cowardly.'),
(17212, 'Coward', 'a.', 'Belonging to a coward; proceeding from, or expressive of,\n   base fear or timidity.'),
(17213, 'Coward', 'n.', 'A person who lacks courage; a timid or pusillanimous\n   person; a poltroon.'),
(17214, 'Coward', 'v. t.', 'To make timorous; to frighten.'),
(17215, 'Cowardie', 'n.', 'Cowardice.'),
(17216, 'Cowardly', 'a.', 'Wanting courage; basely or weakly timid or fearful;\n   pusillanimous; spiritless.'),
(17217, 'Cowardly', 'a.', 'Proceeding from fear of danger or other consequences;\n   befitting a coward; dastardly; base; as, cowardly malignity.'),
(17218, 'Cowardly', 'adv.', 'In the manner of a coward.'),
(17219, 'Cowbane', 'n.', 'A poisonous umbelliferous plant; in England, the Cicuta\n   virosa; in the United States, the Cicuta maculata and the Archemora\n   rigida. See Water hemlock.'),
(17220, 'Cowberry', 'n.', 'A species of Vaccinium (V. Vitis-idaea), which bears acid\n   red berries which are sometimes used in cookery; -- locally called\n   mountain cranberry.'),
(17221, 'Cowbird', 'n.', 'The cow blackbird (Molothrus ater), an American starling.\n   Like the European cuckoo, it builds no nest, but lays its eggs in the\n   nests of other birds; -- so called because frequently associated with\n   cattle.'),
(17222, 'Cowboy', 'n.', 'A cattle herder; a drover; specifically, one of an\n   adventurous class of herders and drovers on the plains of the Western\n   and Southwestern United States.'),
(17223, 'Cowboy', 'n.', 'One of the marauders who, in the Revolutionary War infested\n   the neutral ground between the American and British lines, and\n   committed depredations on the Americans.'),
(17224, 'Cowdie', 'n.', 'See Kauri.'),
(17225, 'Cowered', 'imp. & p. p.', 'of Cower'),
(17226, 'Cowering', 'p. pr. & vb. n.', 'of Cower'),
(17227, 'Cower', 'v. i.', 'To stoop by bending the knees; to crouch; to squat;\n   hence, to quail; to sink through fear.'),
(17228, 'Cower', 'v. t.', 'To cherish with care.'),
(17229, 'Cowfish', 'n.', 'The grampus.'),
(17230, 'Cowfish', 'n.', 'A California dolphin (Tursiops Gillii).'),
(17231, 'Cowfish', 'n.', 'A marine plectognath fish (Ostracoin quadricorne, and\n   allied species), having two projections, like horns, in front; --\n   called also cuckold, coffer fish, trunkfish.'),
(17232, 'Cowhage', 'n.', 'A leguminous climbing plant of the genus Mucuna, having\n   crooked pods covered with sharp hairs, which stick to the fingers,\n   causing intolerable itching. The spiculae are sometimes used in\n   medicine as a mechanical vermifuge.'),
(17233, 'Cowherd', 'n.', 'One whose occupation is to tend cows.'),
(17234, 'Cowhide', 'n.', 'The hide of a cow.'),
(17235, 'Cowhide', 'n.', 'Leather made of the hide of a cow.'),
(17236, 'Cowhide', 'n.', 'A coarse whip made of untanned leather.'),
(17237, 'Cowhided', 'imp. & p. p.', 'of Cowhide'),
(17238, 'Cowhide', 'v. t.', 'To flog with a cowhide.'),
(17239, 'Cowish', 'v. t.', 'Timorous; fearful; cowardly.'),
(17240, 'Cowish', 'n.', 'An umbelliferous plant (Peucedanum Cous) with edible\n   tuberous roots, found in Oregon.'),
