(17697, 'Crescent', 'n.', 'The ancient symbol of Byzantium or Constantinople.'),
(17698, 'Crescent', 'n.', 'The emblem of the Turkish Empire, adopted after the\n   taking of Constantinople.'),
(17699, 'Crescent', 'n.', 'Any one of three orders of knighthood; the first\n   instituted by Charles I., king of Naples and Sicily, in 1268; the\n   second by Rene of Anjou, in 1448; and the third by the Sultan Selim\n   III., in 1801, to be conferred upon foreigners to whom Turkey might be\n   indebted for valuable services.'),
(17700, 'Crescent', 'n.', 'The emblem of the increasing moon with horns directed\n   upward, when used in a coat of arms; -- often used as a mark of cadency\n   to distinguish a second son and his descendants.'),
(17701, 'Crescent', 'a.', 'Shaped like a crescent.'),
(17702, 'Crescent', 'a.', 'Increasing; growing.'),
(17703, 'Crescent', 'v. t.', 'To form into a crescent, or something resembling a\n   crescent.'),
(17704, 'Crescent', 'v. t.', 'To adorn with crescents.'),
(17705, 'Crescive', 'a.', 'Increasing; growing.'),
(17706, 'Cresol', 'n.', 'Any one of three metameric substances, CH3.C6H4.OH,\n   homologous with and resembling phenol. They are obtained from coal tar\n   and wood tar, and are colorless, oily liquids or solids. [Called also\n   cresylic acid.]'),
(17707, 'Cresses', 'pl. ', 'of Cress'),
(17708, 'Cress', 'n.', 'A plant of various species, chiefly cruciferous. The leaves\n   have a moderately pungent taste, and are used as a salad and\n   antiscorbutic.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(17709, 'Cresset', 'n.', 'An open frame or basket of iron, filled with combustible\n   material, to be burned as a beacon; an open lamp or firrepan carried on\n   a pole in nocturnal processions.'),
(17710, 'Cresset', 'n.', 'A small furnace or iron cage to hold fire for charring the\n   inside of a cask, and making the staves flexible.'),
(17711, 'Cressy', 'a.', 'Abounding in cresses.'),
(17712, 'Crest', 'n.', 'A tuft, or other excrescence or natural ornament, growing on\n   an animal\'s head; the comb of a cock; the swelling on the head of a\n   serpent; the lengthened feathers of the crown or nape of bird, etc.'),
(17713, 'Crest', 'n.', 'The plume of feathers, or other decoration, worn on a\n   helmet; the distinctive ornament of a helmet, indicating the rank of\n   the wearer; hence, also, the helmet.'),
(17714, 'Crest', 'n.', 'A bearing worn, not upon the shield, but usually above it,\n   or separately as an ornament for plate, liveries, and the like. It is a\n   relic of the ancient cognizance. See Cognizance, 4.'),
(17715, 'Crest', 'n.', 'The upper curve of a horse\'s neck.'),
(17716, 'Crest', 'n.', 'The ridge or top of a wave.'),
(17717, 'Crest', 'n.', 'The summit of a hill or mountain ridge.'),
(17718, 'Crest', 'n.', 'The helm or head, as typical of a high spirit; pride;\n   courage.'),
(17719, 'Crest', 'n.', 'The ornamental finishing which surmounts the ridge of a\n   roof, canopy, etc.'),
(17720, 'Crest', 'n.', 'The top line of a slope or embankment.'),
(17721, 'Crested', 'imp. & p. p.', 'of Crest'),
(17722, 'Cresting', 'p. pr. & vb. n.', 'of Crest'),
(17723, 'Crest', 'v. t.', 'To furnish with, or surmount as, a crest; to serve as a\n   crest for.'),
(17724, 'Crest', 'v. t.', 'To mark with lines or streaks, like, or regarded as like,\n   waving plumes.'),
(17725, 'Crest', 'v. i.', 'To form a crest.'),
(17726, 'Crested', 'a.', 'Having a crest.'),
(17727, 'Crested', 'a.', 'Having a crest of feathers or hair upon the head.'),
(17728, 'Crested', 'a.', 'Bearing any elevated appendage like a crest, as an\n   elevated line or ridge, or a tuft.'),
(17729, 'Cresting', 'n.', 'An ornamental finish on the top of a wall or ridge of a\n   roof.'),
(17730, 'Cresylic', 'a.', 'Pertaining to, or derived from, cresol, creosote, etc.'),
(17731, 'Cretan', 'a.', 'Pertaining to Crete, or Candia.'),
(17732, 'Cretan', 'n.', 'A native or inhabitant of Crete or Candia.'),
(17733, 'Crete', 'n.', 'A Cretan'),
(17734, 'Cretian', 'a. & n.', 'See Cretan.'),
(17735, 'Cretic', 'n.', 'A poetic foot, composed of one short syllable between two\n   long ones (- / -).'),
(17736, 'Cretin', 'n.', 'One afflicted with cretinism.'),
(17737, 'Cretism', 'n.', 'A Cretan practice; lying; a falsehood.'),
(17738, 'Cretonne', 'n.', 'A strong white fabric with warp of hemp and weft of flax.'),
(17739, 'Cretonne', 'n.', 'A fabric with cotton warp and woolen weft.'),
(17740, 'Cretonne', 'n.', 'A kind of chintz with a glossy surface.'),
(17741, 'Cretose', 'a.', 'Chalky; cretaceous.'),
(17742, 'Creutzer', 'n.', 'See Kreutzer.'),
(17743, 'Creux', 'n.', 'Used in English only in the expression en creux. Thus,\n   engraving en creux is engraving in intaglio, or by sinking or hollowing\n   out the design.'),
(17744, 'Crevalle', 'n.', 'The cavally or jurel.'),
(17745, 'Crevalle', 'n.', 'The pompano (Trachynotus Carolinus).'),
(17746, 'Crevasse', 'n.', 'A deep crevice or fissure, as in embankment; one of the\n   clefts or fissure by which the mass of a glacier is divided.'),
(17747, 'Crevasse', 'n.', 'A breach in the levee or embankment of a river, caused by\n   the pressure of the water, as on the lower Mississippi.'),
(17748, 'Crevet', 'n.', 'A crucible or melting pot; a cruset.'),
(17749, 'Crevice', 'n.', 'A narrow opening resulting from a split or crack or the\n   separation of a junction; a cleft; a fissure; a rent.'),
(17750, 'Crevice', 'v. t.', 'To crack; to flaw.'),
(17751, 'Creviced', 'a.', 'Having a crevice or crevices; as, a creviced structure\n   for storing ears of corn.'),
(17752, 'Crevis', 'n.', 'The crawfish.'),
(17753, 'Crewel', 'n.', 'Worsted yarn,, slackly twisted, used for embroidery.'),
(17754, 'Crewet', 'n.', 'See Cruet.'),
(17755, 'Cribbed', 'imp. & p. p.', 'of Crib'),
(17756, 'Cribbing', 'p. pr. & vb. n.', 'of Crib'),
(17757, 'Cribbage', 'v. t.', 'A game of cards, played by two or four persons, in\n   which there is a crib. (See Crib, 11.) It is characterized by a great\n   variety of chances.'),
(17758, 'Criber', 'n.', 'Alt. of Crib-biter'),
(17759, 'Cribbing', 'n.', 'The act of inclosing or confining in a crib or in close\n   quarters.'),
(17760, 'Cribbing', 'n.', 'Purloining; stealing; plagiarizing.'),
(17761, 'Cribbing', 'n.', 'A framework of timbers and plank backing for a shaft\n   lining, to prevent caving, percolation of water, etc.'),
(17762, 'Cribbing', 'n.', 'A vicious habit of a horse; crib-biting. The horse lays\n   hold of the crib or manger with his teeth and draws air into the\n   stomach with a grunting sound.'),
(17763, 'Cribble', 'n.', 'A coarse sieve or screen.'),
(17764, 'Cribble', 'n.', 'Coarse flour or meal.'),
(17765, 'Cribbled', 'imp. & p. p.', 'of Cribble'),
(17766, 'Cribble', 'v. t.', 'To cause to pass through a sieve or riddle; to sift.'),
(17767, 'Cribble', 'a.', 'Coarse; as, cribble bread.'),
(17768, 'Cribrate', 'a.', 'Cribriform.'),
(17769, 'Cribrose', 'a.', 'Perforated like a sieve; cribriform.'),
(17770, 'Crick', 'n.', 'The creaking of a door, or a noise resembling it.'),
(17771, 'Crick', 'n.', 'A painful, spasmodic affection of the muscles of some part\n   of the body, as of the neck or back, rendering it difficult to move the\n   part.'),
(17772, 'Crick', 'n.', 'A small jackscrew.'),
(17773, 'Cricket', 'n.', 'An orthopterous insect of the genus Gryllus, and allied\n   genera. The males make chirping, musical notes by rubbing together the\n   basal parts of the veins of the front wings.'),
(17774, 'Cricket', 'n.', 'A low stool.'),
(17775, 'Cricket', 'n.', 'A game much played in England, and sometimes in America,\n   with a ball, bats, and wickets, the players being arranged in two\n   contesting parties or sides.'),
(17776, 'Cricket', 'n.', 'A small false roof, or the raising of a portion of a roof,\n   so as to throw off water from behind an obstacle, such as a chimney.'),
(17777, 'Cricket', 'v. i.', 'To play at cricket.'),
(17778, 'Cricoid', 'a.', 'Resembling a ring; -- said esp. of the cartilage at the\n   larynx, and the adjoining parts.'),
(17779, 'Cried', '', 'imp. & p. p. of Cry.'),
(17780, 'Crier', 'n.', 'One who cries; one who makes proclamation.'),
(17781, 'Crier', 'n.', 'an officer who proclaims the orders or directions of a\n   court, or who gives public notice by loud proclamation; as, a\n   town-crier.'),
(17782, 'Crime', 'n.', 'Any violation of law, either divine or human; an omission of\n   a duty commanded, or the commission of an act forbidden by law.'),
(17783, 'Crime', 'n.', 'Gross violation of human law, in distinction from a\n   misdemeanor or trespass, or other slight offense. Hence, also, any\n   aggravated offense against morality or the public welfare; any outrage\n   or great wrong.'),
(17784, 'Crime', 'n.', 'Any great wickedness or sin; iniquity.'),
(17785, 'Crime', 'n.', 'That which occasion crime.'),
(17786, 'Crimeful', 'a.', 'Criminal; wicked; contrary to law, right, or dury.'),
(17787, 'Criminal', 'a.', 'Guilty of crime or sin.'),
(17788, 'Criminal', 'a.', 'Involving a crime; of the nature of a crime; -- said of\n   an act or of conduct; as, criminal carelessness.'),
(17789, 'Criminal', 'a.', 'Relating to crime; -- opposed to civil; as, the criminal\n   code.'),
(17790, 'Criminal', 'n.', 'One who has commited a crime; especially, one who is\n   found guilty by verdict, confession, or proof; a malefactor; a felon.'),
(17791, 'Crimosin', 'n.', 'See Crimson.'),
(17792, 'Crimped', 'imp. & p. p.', 'of Crimp'),
(17793, 'Crimping', 'p. pr. & vb. n.', 'of Crimp'),
(17794, 'Crimp', 'v. t.', 'To fold or plait in regular undulation in such a way that\n   the material will retain the shape intended; to give a wavy appearance\n   to; as, to crimp the border of a cap; to crimp a ruffle. Cf. Crisp.'),
(17795, 'Crimp', 'v. t.', 'To pinch and hold; to seize.'),
(17796, 'Crimp', 'v. t.', 'to entrap into the military or naval service; as, to\n   crimp seamen.'),
(17797, 'Crimp', 'v. t.', 'To cause to contract, or to render more crisp, as the\n   flesh of a fish, by gashing it, when living, with a knife; as, to crimp\n   skate, etc.'),
(17798, 'Crimp', 'a.', 'Easily crumbled; friable; brittle.'),
(17799, 'Crimp', 'a.', 'Weak; inconsistent; contradictory.'),
(17800, 'Crimp', 'n.', 'A coal broker.'),
(17801, 'Crimp', 'n.', 'One who decoys or entraps men into the military or naval\n   service.'),
(17802, 'Crimp', 'n.', 'A keeper of a low lodging house where sailors and emigrants\n   are entrapped and fleeced.'),
(17803, 'Crimp', 'n.', 'Hair which has been crimped; -- usually in pl.'),
(17804, 'Crimp', 'n.', 'A game at cards.'),
(17805, 'Crimpage', 'n.', 'The act or practice of crimping; money paid to a crimp\n   for shipping or enlisting men.'),
(17806, 'Crimper', 'n.', 'One who, or that which, crimps'),
(17807, 'Crimper', 'n.', 'A curved board or frame over which the upper of a boot or\n   shoe is stretched to the required shape.'),
(17808, 'Crimper', 'n.', 'A device for giving hair a wavy appearance.'),
(17809, 'Crimper', 'n.', 'A machine for crimping or ruffling textile fabrics.'),
(17810, 'Crimpled', 'imp. & p. p.', 'of Crimple'),
(17811, 'Crimple', 'v. t.', 'To cause to shrink or draw together; to contract; to\n   curl.'),
(17812, 'Crimpy', 'a.', 'Having a crimped appearance; frizzly; as, the crimpy wool\n   of the Saxony sheep.'),
(17813, 'Crimson', 'n.', 'A deep red color tinged with blue; also, red color in\n   general.'),
(17814, 'Crimson', 'a.', 'Of a deep red color tinged with blue; deep red.'),
(17815, 'Crimson', 'v. t.', 'To dye with crimson or deep red; to redden.'),
(17816, 'Crimson', 'b. t.', 'To become crimson; to blush.'),
(17817, 'Crinal', 'a.', 'Of or pertaining to the hair.'),
(17818, 'Crinated', 'a.', 'Having hair; hairy.'),
(17819, 'Crincum', 'n.', 'A twist or bend; a turn; a whimsey.'),
(17820, 'Crined', 'a.', 'Having the hair of a different tincture from the rest of\n   the body; as, a charge crined of a red tincture.'),
(17821, 'Crinel', 'n.', 'Alt. of Crinet'),
(17822, 'Crinet', 'n.', 'A very fine, hairlike feather.'),
(17823, 'Crnged', 'imp. & p. p.', 'of Cringe'),
(17824, 'Cringing', 'p. pr. & vb. n.', 'of Cringe'),
(17825, 'Cringe', 'v. t.', 'To draw one\'s self together as in fear or servility; to\n   bend or crouch with base humility; to wince; hence; to make court in a\n   degrading manner; to fawn.'),
(17826, 'Cringe', 'v. t.', 'To contract; to draw together; to cause to shrink or\n   wrinkle; to distort.'),
(17827, 'Cringe', 'n.', 'Servile civility; fawning; a shrinking or bowing, as in\n   fear or servility.'),
(17828, 'Cringer', 'n.', 'One who cringes.'),
(17829, 'Cringle', 'n.', 'A withe for fastening a gate.'),
(17830, 'Cringle', 'n.', 'An iron or pope thimble or grommet worked into or attached\n   to the edges and corners of a sail; -- usually in the plural. The\n   cringles are used for making fast the bowline bridles, earings, etc.'),
(17831, 'Crinital', 'a.', 'Same as Crinite, 1.'),
(17832, 'Crinite', 'a.', 'Having the appearance of a tuft of hair; having a hairlike\n   tail or train.'),
(17833, 'Crinite', 'a.', 'Bearded or tufted with hairs.'),
(17834, 'Crinkled', 'imp. & p. p.', 'of Crinkle'),
(17835, 'Crinkle', 'v. t.', 'To form with short turns, bends, or wrinkles; to mold\n   into inequalities or sinuosities; to cause to wrinkle or curl.'),
(17836, 'Crinkle', 'v. i.', 'To turn or wind; to run in and out in many short bends\n   or turns; to curl; to run in waves; to wrinkle; also, to rustle, as\n   stiff cloth when moved.'),
(17837, 'Crinkle', 'n.', 'A winding or turn; wrinkle; sinuosity.'),
(17838, 'Crinkled', 'a.', 'Having short bends, turns, or wrinkles; wrinkled; wavy;\n   zigzag.'),
(17839, 'Crinkly', 'a.', 'Having crinkles; wavy; wrinkly.'),
(17840, 'Crinoid', 'a.', 'Crinoidal.'),
(17841, 'Crinoid', 'n.', 'One of the Crinoidea.'),
(17842, 'Crinose', 'a.', 'Hairy.'),
(17843, 'Crinum', 'n.', 'A genus of bulbous plants, of the order Amaryllidace/,\n   cultivated as greenhouse plants on account of their beauty.'),
(17844, 'Cripple', 'n.', 'One who creeps, halts, or limps; one who has lost, or\n   never had, the use of a limb or limbs; a lame person; hence, one who is\n   partially disabled.'),
(17845, 'Cripple', 'a.', 'Lame; halting.'),
(17846, 'Crippled', 'imp. & p. p.', 'of Cripple'),
(17847, 'Cripple', 'v. t.', 'To deprive of the use of a limb, particularly of a leg\n   or foot; to lame.'),
(17848, 'Cripple', 'v. t.', 'To deprive of strength, activity, or capability for\n   service or use; to disable; to deprive of resources; as, to be\n   financially crippled.'),
(17849, 'Crippled', 'a.', 'Lamed; lame; disabled; impeded.'),
(17850, 'Crippler', 'n.', 'A wooden tool used in graining leather.'),
(17851, 'Cripply', 'a.', 'Lame; disabled; in a crippled condition.'),
(17852, 'Crises', 'pl. ', 'of Crisis'),
(17853, 'Crisis', 'n.', 'The point of time when it is to be decided whether any\n   affair or course of action must go on, or be modified or terminate; the\n   decisive moment; the turning point.'),
(17854, 'Crisis', 'n.', 'That change in a disease which indicates whether the result\n   is to be recovery or death; sometimes, also, a striking change of\n   symptoms attended by an outward manifestation, as by an eruption or\n   sweat.'),
(17855, 'Crisp', 'a.', 'Curling in stiff curls or ringlets; as, crisp hair.'),
(17856, 'Crisp', 'a.', 'Curled with the ripple of the water.'),
(17857, 'Crisp', 'a.', 'Brittle; friable; in a condition to break with a short,\n   sharp fracture; as, crisp snow.'),
(17858, 'Crisp', 'a.', 'Possessing a certain degree of firmness and freshness; in a\n   fresh, unwilted condition.'),
(17859, 'Crisp', 'a.', 'Lively; sparking; effervescing.'),
(17860, 'Crisp', 'a.', 'Brisk; crackling; cheerful; lively.'),
(17861, 'Crisped', 'imp. & p. p.', 'of Crisp'),
(17862, 'Crisping', 'p. pr. & vb. n.', 'of Crisp'),
(17863, 'Crisp', 'a.', 'To curl; to form into ringlets, as hair, or the nap of\n   cloth; to interweave, as the branches of trees.'),
(17864, 'Crisp', 'a.', 'To cause to undulate irregularly, as crape or water; to\n   wrinkle; to cause to ripple. Cf. Crimp.'),
(17865, 'Crisp', 'a.', 'To make crisp or brittle, as in cooking.'),
(17866, 'Crisp', 'v. i.', 'To undulate or ripple. Cf. Crisp, v. t.'),
(17867, 'Crisp', 'n.', 'That which is crisp or brittle; the state of being crisp or\n   brittle; as, burned to a crisp; specifically, the rind of roasted pork;\n   crackling.'),
(17868, 'Crispate', 'a.', 'Alt. of Crispated'),
(17869, 'Crisper', 'n.', 'One who, or that which, crisps or curls; an instrument for\n   making little curls in the nap of cloth, as in chinchilla.'),
(17870, 'Crispin', 'n.', 'A shoemaker; -- jocularly so called from the patron saint\n   of the craft.'),
(17871, 'Crispin', 'n.', 'A member of a union or association of shoemakers.'),
(17872, 'Crisply', 'adv.', 'In a crisp manner.'),
(17873, 'Crispy', 'a.', 'Formed into short, close ringlets; frizzed; crisp; as,\n   crispy locks.'),
(17874, 'Crispy', 'a.', 'Crisp; brittle; as, a crispy pie crust.'),
(17875, 'Crissal', 'a.', 'Pertaining to the crissum; as, crissal feathers.'),
(17876, 'Crissal', 'a.', 'Having highly colored under tail coverts; as, the crissal\n   thrasher.'),
(17877, 'Crissa', 'pl. ', 'of Crissum'),
(17878, 'Crissum', 'n.', 'That part of a bird, or the feathers, surrounding the\n   cloacal opening; the under tail coverts.'),
(17879, 'Cristate', 'a.', 'Crested.'),
(17880, 'Criteria', 'pl. ', 'of Criterion'),
(17881, 'Crith', 'n.', 'The unit for estimating the weight of a/riform substances;\n   -- the weight of a liter of hydrogen at 0/ centigrade, and with a\n   tension of 76 centimeters of mercury. It is 0.0896 of a gram, or\n   1.38274 grains.'),
(17882, 'Critic', 'n.', 'One skilled in judging of the merits of literary or\n   artistic works; a connoisseur; an adept; hence, one who examines\n   literary or artistic works, etc., and passes judgment upon them; a\n   reviewer.'),
(17883, 'Critic', 'n.', 'One who passes a rigorous or captious judgment; one who\n   censures or finds fault; a harsh examiner or judge; a caviler; a\n   carper.'),
(17884, 'Critic', 'n.', 'The art of criticism.'),
(17885, 'Critic', 'n.', 'An act of criticism; a critique.'),
(17886, 'Critic', 'a.', 'Of or pertaining to critics or criticism; critical.'),
(17887, 'Critic', 'v. i.', 'To criticise; to play the critic.'),
(17888, 'Critical', 'n.', 'Qualified to criticise, or pass judgment upon, literary\n   or artistic productions.'),
(17889, 'Critical', 'n.', 'Pertaining to criticism or the critic\'s art; of the\n   nature of a criticism; accurate; as, critical knowledge; a critical\n   dissertation.'),
(17890, 'Critical', 'n.', 'Inclined to make nice distinctions, or to exercise\n   careful judgment and selection; exact; nicely judicious.'),
(17891, 'Critical', 'n.', 'Inclined to criticise or find fault; fastidious;\n   captious; censorious; exacting.'),
(17892, 'Critical', 'n.', 'Characterized by thoroughness and a reference to\n   principles, as becomes a critic; as, a critical analysis of a subject.'),
(17893, 'Critical', 'n.', 'Pertaining to, or indicating, a crisis, turning point, or\n   specially important juncture; important as regards consequences; hence,\n   of doubtful issue; attended with risk; dangerous; as, the critical\n   stage of a fever; a critical situation.'),
(17894, 'Critique', 'n.', 'The art of criticism.'),
(17895, 'Critique', 'n.', 'A critical examination or estimate of a work of\n   literature or art; a critical dissertation or essay; a careful and\n   through analysis of any subject; a criticism; as, Kant\'s \"Critique of\n   Pure Reason.\"'),
(17896, 'Critique', 'n.', 'A critic; one who criticises.'),
(17897, 'Critique', 'v.', 'To criticise or pass judgment upon.'),
(17898, 'Crizzel', 'n.', 'A kind of roughness on the surface of glass, which clouds\n   its transparency.'),
(17899, 'Croaked', 'imp. & p. p.', 'of Croak'),
(17900, 'Croaking', 'p. pr. & vb. n.', 'of Croak'),
(17901, 'Croak', 'v. i.', 'To make a low, hoarse noise in the throat, as a frog, a\n   raven, or a crow; hence, to make any hoarse, dismal sound.'),
(17902, 'Croak', 'v. i.', 'To complain; especially, to grumble; to forebode evil; to\n   utter complaints or forebodings habitually.'),
(17903, 'Croak', 'v. t.', 'To utter in a low, hoarse voice; to announce by croaking;\n   to forebode; as, to croak disaster.'),
(17904, 'Croak', 'n.', 'The coarse, harsh sound uttered by a frog or a raven, or a\n   like sound.'),
(17905, 'Croaker', 'n.', 'One who croaks, murmurs, grumbles, or complains\n   unreasonably; one who habitually forebodes evil.'),
(17906, 'Croaker', 'n.', 'A small American fish (Micropogon undulatus), of the\n   Atlantic coast.'),
(17907, 'Croaker', 'n.', 'An American fresh-water fish (Aplodinotus grunniens); --\n   called also drum.'),
(17908, 'Croaker', 'n.', 'The surf fish of California.'),
(17909, 'Croat', 'n.', 'A native of Croatia, in Austria; esp., one of the native\n   Slavic race.'),
(17910, 'Croat', 'n.', 'An irregular soldier, generally from Croatia.'),
(17911, 'Croatian', 'a.', 'Of or pertaining to Croatia.'),
(17912, 'Croatian', 'n.', 'A Croat.'),
(17913, 'Crocein', 'n.', 'A name given to any one of several yellow or scarlet\n   dyestuffs of artificial production and complex structure. In general\n   they are diazo and sulphonic acid derivatives of benzene and naphthol.'),
(17914, 'Croceous', 'a.', 'Of, pertaining to, or like, saffron; deep reddish yellow.'),
(17915, 'Crocetin', 'n.', 'A dyestuff, obtained from the Chinese crocin, which\n   produces a brilliant yellow.'),
(17916, 'Croche', 'n.', 'A little bud or knob at the top of a deer\'s antler.'),
(17917, 'Crochet', 'n.', 'A kind of knitting done by means of a hooked needle, with\n   worsted, silk, or cotton; crochet work. Commonly used adjectively.'),
(17918, 'Crochet', 'v. t. & i.', 'To knit with a crochet needle or hook; as, to\n   crochet a shawl.'),
(17919, 'Crociary', 'n.', 'One who carries the cross before an archbishop.'),
(17920, 'Crocin', 'n.', 'The coloring matter of Chinese yellow pods, the fruit of\n   Gardenia grandiflora.'),
(17921, 'Crocin', 'n.', 'A red powder (called also polychroite), which is made from\n   the saffron (Crocus sativus). See Polychroite.'),
(17922, 'Crock', 'n.', 'The loose black particles collected from combustion, as on\n   pots and kettles, or in a chimney; soot; smut; also, coloring matter\n   which rubs off from cloth.'),
(17923, 'Crocked', 'imp. & p. p.', 'of Crock'),
(17924, 'Crocking', 'p. pr. & vb. n.', 'of Crock'),
(17925, 'Crock', 'v. t.', 'To soil by contact, as with soot, or with the coloring\n   matter of badly dyed cloth.'),
(17926, 'Crock', 'v. i.', 'To give off crock or smut.'),
(17927, 'Crock', 'n.', 'A low stool.'),
