(18164, 'Crowtoe', 'n.', 'An unidentified plant, probably the crowfoot.'),
(18165, 'Croys', 'n.', 'See Cross, n.'),
(18166, 'Croze', 'n.', 'A cooper\'s tool for making the grooves for the heads of\n   casks, etc.; also, the groove itself.'),
(18167, 'Crozier', 'n.', 'See Crosier.'),
(18168, 'Crucial', 'a.', 'Having the form of a cross; appertaining to a cross;\n   cruciform; intersecting; as, crucial ligaments; a crucial incision.'),
(18169, 'Crucial', 'a.', 'Severe; trying or searching, as if bringing to the cross;\n   decisive; as, a crucial test.'),
(18170, 'Cruciate', 'a.', 'Tormented.'),
(18171, 'Cruciate', 'a.', 'Having the leaves or petals arranged in the form of a\n   cross; cruciform.'),
(18172, 'Cruciate', 'v. t.', 'To torture; to torment. [Obs.] See Excruciate.'),
(18173, 'Crucible', 'n.', 'A vessel or melting pot, composed of some very refractory\n   substance, as clay, graphite, platinum, and used for melting and\n   calcining substances which require a strong degree of heat, as metals,\n   ores, etc.'),
(18174, 'Crucible', 'n.', 'A hollow place at the bottom of a furnace, to receive the\n   melted metal.'),
(18175, 'Crucible', 'n.', 'A test of the most decisive kind; a severe trial; as, the\n   crucible of affliction.'),
(18176, 'Crucifer', 'n.', 'Any plant of the order Cruciferae.'),
(18177, 'Crucifix', 'n.', 'A representation in art of the figure of Christ upon the\n   cross; esp., the sculptured figure affixed to a real cross of wood,\n   ivory, metal, or the like, used by the Roman Catholics in their\n   devotions.'),
(18178, 'Crucifix', 'n.', 'The cross or religion of Christ.'),
(18179, 'Crucify', 'v. t.', 'To fasten to a cross; to put to death by nailing the\n   hands and feet to a cross or gibbet.'),
(18180, 'Crucify', 'v. t.', 'To destroy the power or ruling influence of; to subdue\n   completely; to mortify.'),
(18181, 'Crucify', 'v. t.', 'To vex or torment.'),
(18182, 'Cruddle', 'v. i.', 'To curdle.'),
(18183, 'Crude', 'superl.', 'In its natural state; not cooked or prepared by fire or\n   heat; undressed; not altered, refined, or prepared for use by any\n   artificial process; raw; as, crude flesh.'),
(18184, 'Crude', 'superl.', 'Unripe; not mature or perfect; immature.'),
(18185, 'Crude', 'superl.', 'Not reduced to order or form; unfinished; not arranged\n   or prepared; ill-considered; immature.'),
(18186, 'Crude', 'superl.', 'Undigested; unconcocted; not brought into a form to\n   give nourishment.'),
(18187, 'Crude', 'superl.', 'Having, or displaying, superficial and undigested\n   knowledge; without culture or profundity; as, a crude reasoner.'),
(18188, 'Crude', 'superl.', 'Harsh and offensive, as a color; tawdry or in bad\n   taste, as a combination of colors, or any design or work of art.'),
(18189, 'Crudely', 'adv.', 'In a crude, immature manner.'),
(18190, 'Crudity', 'n.', 'The condition of being crude; rawness.'),
(18191, 'Crudity', 'n.', 'That which is in a crude or undigested state; hence,\n   superficial, undigested views, not reduced to order or form.'),
(18192, 'Crudle', 'v. i.', 'See Cruddle.'),
(18193, 'Crudy', 'a.', 'Coagulated.'),
(18194, 'Crudy', 'a.', 'Characterized by crudeness; raw.'),
(18195, 'Cruel', 'n.', 'See Crewel.'),
(18196, 'Cruel', 'a.', 'Disposed to give pain to others; willing or pleased to hurt,\n   torment, or afflict; destitute of sympathetic kindness and pity;\n   savage; inhuman; hard-hearted; merciless.'),
(18197, 'Cruel', 'a.', 'Causing, or fitted to cause, pain, grief, or misery.'),
(18198, 'Cruel', 'a.', 'Attended with cruetly; painful; harsh.'),
(18199, 'Cruelly', 'adv.', 'In a cruel manner.'),
(18200, 'Cruelly', 'adv.', 'Extremely; very.'),
(18201, 'Cruels', 'n. pl.', 'Glandular scrofulous swellings in the neck.'),
(18202, 'Cruelty', 'n.', 'The attribute or quality of being cruel; a disposition to\n   give unnecessary pain or suffering to others; inhumanity; barbarity.'),
(18203, 'Cruelty', 'n.', 'A cruel and barbarous deed; inhuman treatment; the act of\n   willfully causing unnecessary pain.'),
(18204, 'Cruet', 'n.', 'A bottle or vessel; esp., a vial or small glass bottle for\n   holding vinegar, oil, pepper, or the like, for the table; a caster.'),
(18205, 'Cruet', 'n.', 'A vessel used to hold wine, oil, or water for the service of\n   the altar.'),
(18206, 'Cruise', 'n.', 'See Cruse, a small bottle.'),
(18207, 'Cruised', 'imp. & p. p.', 'of Cruise'),
(18208, 'Cruising', 'p. pr. & vb. n.', 'of Cruise'),
(18209, 'Cruise', 'v. i.', 'To sail back and forth on the ocean; to sail, as for the\n   potection of commerce, in search of an enemy, for plunder, or for\n   pleasure.'),
(18210, 'Cruise', 'v. i.', 'To wander hither and thither on land.'),
(18211, 'Cruise', 'n.', 'A voyage made in various directions, as of an armed vessel,\n   for the protection of other vessels, or in search of an enemy; a\n   sailing to and fro, as for exploration or for pleasure.'),
(18212, 'Cruiser', 'n.', 'One who, or a vessel that, cruises; -- usually an armed\n   vessel.'),
(18213, 'Cruive', 'n.', 'A kind of weir or dam for trapping salmon; also, a hovel.'),
(18214, 'Crull', 'a.', 'Curly; curled.'),
(18215, 'Cruller', 'n.', 'A kind of sweet cake cut in strips and curled or twisted,\n   and fried crisp in boiling fat.'),
(18216, 'Crumb', 'n.', 'A small fragment or piece; especially, a small piece of\n   bread or other food, broken or cut off.'),
(18217, 'Crumb', 'n.', 'Fig.: A little; a bit; as, a crumb of comfort.'),
(18218, 'Crumb', 'n.', 'The soft part of bread.'),
(18219, 'Crumbed', 'imp. & p. p.', 'of Crumb'),
(18220, 'Crumbing', 'p. pr. & vb. n.', 'of Crumb'),
(18221, 'Crumb', 'v. t.', 'To break into crumbs or small pieces with the fingers;\n   as, to crumb bread.'),
(18222, 'Crumbled', 'imp. & p. p.', 'of Crumble'),
(18223, 'Crumble', 'v. t.', 'To break into small pieces; to cause to fall in pieces.'),
(18224, 'Crumble', 'v. i.', 'To fall into small pieces; to break or part into small\n   fragments; hence, to fall to decay or ruin; to become disintegrated; to\n   perish.'),
(18225, 'Crumbly', 'a.', 'EAsily crumbled; friable; brittle.'),
(18226, 'Crumenal', 'n.', 'A purse.'),
(18227, 'Crummy', 'a.', 'Full of crumb or crumbs.'),
(18228, 'Crummy', 'a.', 'Soft, as the crumb of bread is; not crusty.'),
(18229, 'Crump', 'a.', 'Crooked; bent.'),
(18230, 'Crump', 'a.', 'Hard or crusty; dry baked; as, a crump loaf.'),
(18231, 'Crumpet', 'n.', 'A kind of large, thin muffin or cake, light and spongy,\n   and cooked on a griddle or spider.'),
(18232, 'Crumpled', 'imp. & p. p.', 'of Crumple');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(18233, 'Crumple', 'v. t.', 'To draw or press into wrinkles or folds; to crush\n   together; to rumple; as, to crumple paper.'),
(18234, 'Crumple', 'v. i.', 'To contract irregularly; to show wrinkles after being\n   crushed together; as, leaves crumple.'),
(18235, 'Crumpy', 'a.', 'Brittle; crisp.'),
(18236, 'Crunched', 'imp. & p. p.', 'of Crunch'),
(18237, 'Crunch', 'v. i.', 'To chew with force and noise; to craunch.'),
(18238, 'Crunch', 'v. i.', 'To grind or press with violence and noise.'),
(18239, 'Crunch', 'v. i.', 'To emit a grinding or craunching noise.'),
(18240, 'Crunch', 'v. t.', 'To crush with the teeth; to chew with a grinding noise;\n   to craunch; as, to crunch a biscuit.'),
(18241, 'Crunk', 'v. i.', 'Alt. of Crunkle'),
(18242, 'Crunkle', 'v. i.', 'To cry like a crane.'),
(18243, 'Crunodal', 'a.', 'Possessing, or characterized by, a crunode; -- used of\n   curves.'),
(18244, 'Crunode', 'n.', 'A point where one branch of a curve crosses another\n   branch. See Double point, under Double, a.'),
(18245, 'Cruor', 'n.', 'The coloring matter of the blood; the clotted portion of\n   coagulated blood, containing the coloring matter; gore.'),
(18246, 'Cruorin', 'n.', 'The coloring matter of the blood in the living animal;\n   haemoglobin.'),
(18247, 'Crupper', 'n.', 'The buttocks or rump of a horse.'),
(18248, 'Crupper', 'n.', 'A leather loop, passing under a horse\'s tail, and buckled\n   to the saddle to keep it from slipping forwards.'),
(18249, 'Crupper', 'v. t.', 'To fit with a crupper; to place a crupper upon; as, to\n   crupper a horse.'),
(18250, 'Crura', 'n. pl.', 'See Crus.'),
(18251, 'Crural', 'a.', 'Of or pertaining to the thigh or leg, or to any of the\n   parts called crura; as, the crural arteries; crural arch; crural canal;\n   crural ring.'),
(18252, 'Crura', 'pl. ', 'of Crus'),
(18253, 'Crusade', 'n.', 'Any one of the military expeditions undertaken by\n   Christian powers, in the 11th, 12th, and 13th centuries, for the\n   recovery of the Holy Land from the Mohammedans.'),
(18254, 'Crusade', 'n.', 'Any enterprise undertaken with zeal and enthusiasm; as, a\n   crusade against intemperance.'),
(18255, 'Crusade', 'n.', 'A Portuguese coin. See Crusado.'),
(18256, 'Crusaded', 'imp. & p. p.', 'of Crusade'),
(18257, 'Crusade', 'v. i.', 'To engage in a crusade; to attack in a zealous or\n   hot-headed manner.'),
(18258, 'Crusader', 'n.', 'One engaged in a crusade; as, the crusaders of the Middle\n   Ages.'),
(18259, 'Crusado', 'n.', 'An old Portuguese coin, worth about seventy cents.'),
(18260, 'Cruse', 'n.', 'A cup or dish.'),
(18261, 'Cruse', 'n.', 'A bottle for holding water, oil, honey, etc.'),
(18262, 'Cruset', 'n.', 'A goldsmith\'s crucible or melting pot.'),
(18263, 'Crushed', 'imp. & p. p.', 'of Crush'),
(18264, 'Crushing', 'p. pr. & vb. n.', 'of Crush'),
(18265, 'Crush', 'v. t.', 'To press or bruise between two hard bodies; to squeeze,\n   so as to destroy the natural shape or integrity of the parts, or to\n   force together into a mass; as, to crush grapes.'),
(18266, 'Crush', 'v. t.', 'To reduce to fine particles by pounding or grinding; to\n   comminute; as, to crush quartz.'),
(18267, 'Crush', 'v. t.', 'To overwhelm by pressure or weight; to beat or force\n   down, as by an incumbent weight.'),
(18268, 'Crush', 'v. t.', 'To oppress or burden grievously.'),
(18269, 'Crush', 'v. t.', 'To overcome completely; to subdue totally.'),
(18270, 'Crush', 'v. i.', 'To be or become broken down or in, or pressed into a\n   smaller compass, by external weight or force; as, an eggshell crushes\n   easily.'),
(18271, 'Crush', 'n.', 'A violent collision or compression; a crash; destruction;\n   ruin.'),
(18272, 'Crush', 'n.', 'Violent pressure, as of a crowd; a crowd which produced\n   uncomfortable pressure; as, a crush at a peception.'),
(18273, 'Crusher', 'n.', 'One who, or that which, crushes.'),
(18274, 'Crushing', 'a.', 'That crushes; overwhelming.'),
(18275, 'Crust', 'n.', 'The hard external coat or covering of anything; the hard\n   exterior surface or outer shell; an incrustation; as, a crust of snow.'),
(18276, 'Crust', 'n.', 'The hard exterior or surface of bread, in distinction from\n   the soft part or crumb; or a piece of bread grown dry or hard.'),
(18277, 'Crust', 'n.', 'The cover or case of a pie, in distinction from the soft\n   contents.'),
(18278, 'Crust', 'n.', 'The dough, or mass of doughy paste, cooked with a potpie; --\n   also called dumpling.'),
(18279, 'Crust', 'n.', 'The exterior portion of the earth, formerly universally\n   supposed to inclose a molten interior.'),
(18280, 'Crust', 'n.', 'The shell of crabs, lobsters, etc.'),
(18281, 'Crust', 'n.', 'A hard mass, made up of dried secretions blood, or pus,\n   occurring upon the surface of the body.'),
(18282, 'Crust', 'n.', 'An incrustation on the interior of wine bottles, the result\n   of the ripening of the wine; a deposit of tartar, etc. See Beeswing.'),
(18283, 'Crusted', 'imp. & p. p.', 'of Crust'),
(18284, 'Crusting', 'p. pr. & vb. n.', 'of Crust'),
(18285, 'Crust', 'n.', 'To cover with a crust; to cover or line with an\n   incrustation; to incrust.'),
(18286, 'Crust', 'v. i.', 'To gather or contract into a hard crust; to become\n   incrusted.'),
(18287, 'Crusta', 'n.', 'A crust or shell.'),
(18288, 'Crusta', 'n.', 'A gem engraved, or a plate embossed in low relief, for\n   inlaying a vase or other object.'),
(18289, 'Crustal', 'a.', 'Relating to a crust.'),
(18290, 'Crusted', 'a.', 'Incrusted; covered with, or containing, crust; as, old,\n   crusted port wine.'),
(18291, 'Crustily', 'adv.', 'In a crusty or surly manner; morosely.'),
(18292, 'Crusty', 'a.', 'Having the nature of crust; pertaining to a hard covering;\n   as, a crusty coat; a crusty surface or substance.'),
(18293, 'Crusty', 'a.', 'Having a hard exterior, or a short, rough manner, though\n   kind at heart; snappish; peevish; surly.'),
(18294, 'Crutches', 'pl. ', 'of Crutch'),
(18295, 'Crutch', 'n.', 'A staff with a crosspiece at the head, to be placed under\n   the arm or shoulder, to support the lame or infirm in walking.'),
(18296, 'Crutch', 'n.', 'A form of pommel for a woman\'s saddle, consisting of a\n   forked rest to hold the leg of the rider.'),
(18297, 'Crutch', 'n.', 'A knee, or piece of knee timber'),
(18298, 'Crutch', 'n.', 'A forked stanchion or post; a crotch. See Crotch.'),
(18299, 'Crutch', 'v. t.', 'To support on crutches; to prop up.'),
(18300, 'Crutched', 'a.', 'Supported upon crutches.'),
(18301, 'Crutched', 'a.', 'Marked with the sign of the cross; crouched.'),
(18302, 'Cruth', 'n.', 'See 4th Crowd.'),
(18303, 'Cruxes', 'pl. ', 'of Crux'),
(18304, 'Cruces', 'pl. ', 'of Crux'),
(18305, 'Cruzado', 'n.', 'A coin. See Crusado.'),
(18306, 'Crwth', 'n.', 'See 4th Crowd.'),
(18307, 'Cried', 'imp. & p. p.', 'of Cry'),
(18308, 'Crying', 'p. pr. & vb. n.', 'of Cry'),
(18309, 'Cries', 'pl. ', 'of Cry'),
(18310, 'Cryal', 'n.', 'The heron'),
(18311, 'Cryer', 'n.', 'The female of the hawk; a falcon-gentil.'),
(18312, 'Crying', 'a.', 'Calling for notice; compelling attention; notorious;\n   heinous; as, a crying evil.'),
(18313, 'Cryolite', 'n.', 'A fluoride of sodium and aluminum, found in Greenland, in\n   white cleavable masses; -- used as a source of soda and alumina.'),
(18314, 'Crypt', 'n.', 'A vault wholly or partly under ground; especially, a vault\n   under a church, whether used for burial purposes or for a subterranean\n   chapel or oratory.'),
(18315, 'Crypt', 'n.', 'A simple gland, glandular cavity, or tube; a follicle; as,\n   the crypts of Lieberk/hn, the simple tubular glands of the small\n   intestines.'),
(18316, 'Cryptal', 'a.', 'Of or pertaining to crypts.'),
(18317, 'Cryptic', 'a.', 'Alt. of Cryptical'),
(18318, 'Crypturi', 'n. pl.', 'An order of flying, drom/ognathous birds, including\n   the tinamous of South America. See Tinamou.'),
(18319, 'Crystal', 'n.', 'The regular form which a substance tends to assume in\n   solidifying, through the inherent power of cohesive attraction. It is\n   bounded by plane surfaces, symmetrically arranged, and each species of\n   crystal has fixed axial ratios. See Crystallization.'),
(18320, 'Crystal', 'n.', 'The material of quartz, in crystallization transparent or\n   nearly so, and either colorless or slightly tinged with gray, or the\n   like; -- called also rock crystal. Ornamental vessels are made of it.\n   Cf. Smoky quartz, Pebble; also Brazilian pebble, under Brazilian.'),
(18321, 'Crystal', 'n.', 'A species of glass, more perfect in its composition and\n   manufacture than common glass, and often cut into ornamental forms. See\n   Flint glass.'),
(18322, 'Crystal', 'n.', 'The glass over the dial of a watch case.'),
(18323, 'Crystal', 'n.', 'Anything resembling crystal, as clear water, etc.'),
(18324, 'Crystal', 'a.', 'Consisting of, or like, crystal; clear; transparent;\n   lucid; pellucid; crystalline.'),
(18325, 'Ctenoid', 'a.', 'Having a comblike margin, as a ctenoid scale'),
(18326, 'Ctenoid', 'a.', 'Pertaining to the Ctenoidei.'),
(18327, 'Ctenoid', 'n.', 'A ctenoidean.'),
(18328, 'Cubbed', 'imp. & p. p.', 'of Cub'),
(18329, 'Cubbing', 'p. pr. & vb. n.', 'of Cub'),
(18330, 'Cuban', 'a.', 'Of or pertaining to Cuba or its inhabitants.'),
(18331, 'Cuban', 'n.', 'A native or an inhabitant of Cuba.'),
(18332, 'Cubation', 'n.', 'The act of lying down; a reclining.'),
(18333, 'Cubatory', 'a.', 'Lying down; recumbent.'),
(18334, 'Cubature', 'n.', 'The process of determining the solid or cubic contents of\n   a body.'),
(18335, 'Cubby', 'n.', 'Alt. of Cubbyhole'),
(18336, 'Cubdrawn', 'a.', 'Sucked by cubs.'),
(18337, 'Cubed', 'imp. & p. p.', 'of Cube'),
(18338, 'Cubing', 'p. pr. & vb. n.', 'of Cube'),
(18339, 'Cubeb', 'n.', 'The small, spicy berry of a species of pepper (Piper Cubeba;\n   in med., Cubeba officinalis), native in Java and Borneo, but now\n   cultivated in various tropical countries. The dried unripe fruit is\n   much used in medicine as a stimulant and purgative.'),
(18340, 'Cubebic', 'a.', 'Pertaining to, or derived from, cubebs; as, cubebic acid\n   (a soft olive-green resin extracted from cubebs).'),
(18341, 'Cubhood', 'n.', 'The state of being a cub.'),
(18342, 'Cubic', 'a.', 'Alt. of Cubical'),
(18343, 'Cubical', 'a.', 'Having the form or properties of a cube; contained, or\n   capable of being contained, in a cube.'),
(18344, 'Cubical', 'a.', 'Isometric or monometric; as, cubic cleavage. See\n   Crystallization.'),
(18345, 'Cubic', 'n.', 'A curve of the third degree.'),
(18346, 'Cubicle', 'n.', 'A loding room; esp., a sleeping place partitioned off from\n   a large dormitory.'),
(18347, 'Cubiform', 'a.', 'Of the form of a cube.'),
(18348, 'Cubile', 'n.', 'The lowest course of stones in a building.'),
(18349, 'Cubilose', 'n.', 'A mucilagenous secretion of certain birds found as the\n   characteristic ingredient of edible bird\'s-nests.'),
(18350, 'Cubit', 'n.', 'The forearm; the ulna, a bone of the arm extending from\n   elbow to wrist.'),
(18351, 'Cubit', 'n.', 'A measure of length, being the distance from the elbow to\n   the extremity of the middle finger.'),
(18352, 'Cubital', 'a.', 'Of or pertaining to the cubit or ulna; as, the cubital\n   nerve; the cubital artery; the cubital muscle.'),
(18353, 'Cubital', 'a.', 'Of the length of a cubit.'),
(18354, 'Cubital', 'n.', 'A sleeve covering the arm from the elbow to the hand.'),
(18355, 'Cubited', 'a.', 'Having the measure of a cubit.'),
(18356, 'Cubless', 'a.', 'Having no cubs.'),
(18357, 'Cuboid', 'a.', 'Cube-shaped, or nearly so; as, the cuboid bone of the foot.'),
(18358, 'Cuboid', 'n.', 'The bone of the tarsus, which, in man and most mammals,\n   supports the metatarsals of the fourth and fifth toes.'),
(18359, 'Cuboidal', 'a.', 'Cuboid.'),
(18360, 'Cuckold', 'n.', 'A man whose wife is unfaithful; the husband of an\n   adulteress.'),
(18361, 'Cuckold', 'n.', 'A West Indian plectognath fish (Ostracion triqueter).'),
(18362, 'Cuckold', 'n.', 'The cowfish.'),
(18363, 'Cuckold', 'v. t.', 'To make a cuckold of, as a husband, by seducing his\n   wife, or by her becoming an adulteress.'),
(18364, 'Cuckoo', 'n.', 'A bird belonging to Cuculus, Coccyzus, and several allied\n   genera, of many species.'),
(18365, 'Cucquean', 'n.', 'A woman whose husband is unfaithful to her.'),
(18366, 'Cucujo', 'n.', 'The fire beetle of Mexico and the West Indies.'),
(18367, 'Cuculoid', 'a.', 'Like or belonging to the cuckoos (Cuculidae).'),
(18368, 'Cucumber', 'n.', 'A creeping plant, and its fruit, of several species of\n   the genus Cucumis, esp. Cucumis sativus, the unripe fruit of which is\n   eaten either fresh or picked. Also, similar plants or fruits of several\n   other genera. See below.'),
(18369, 'Cucumis', 'n.', 'A genus of plants including the cucumber, melon, and same\n   kinds of gourds.'),
(18370, 'Cucurbit', 'n.', 'Alt. of Cucurbite'),
(18371, 'Cudbear', 'n.', 'A powder of a violet red color, difficult to moisten with\n   water, used for making violet or purple dye. It is prepared from\n   certain species of lichen, especially Lecanora tartarea.'),
(18372, 'Cudbear', 'n.', 'A lichen (Lecanora tartarea), from which the powder is\n   obtained.'),
(18373, 'Cudden', 'n.', 'A clown; a low rustic; a dolt.'),
(18374, 'Cudden', 'n.', 'The coalfish. See 3d Cuddy.'),
(18375, 'Cuddled', 'imp. & p. p.', 'of Cuddle'),
(18376, 'Cuddling', 'p. pr. & vb. n.', 'of Cuddle'),
(18377, 'Cuddle', 'v. i.', 'To lie close or snug; to crouch; to nestle.'),
(18378, 'Cuddle', 'v. t.', 'To embrace closely; to fondle.'),
(18379, 'Cuddle', 'n.', 'A close embrace.'),
(18380, 'Cuddy', 'n.', 'An ass; esp., one driven by a huckster or greengrocer.'),
(18381, 'Cuddy', 'n.', 'A blockhead; a lout.'),
(18382, 'Cuddy', 'n.', 'A lever mounted on a tripod for lifting stones, leveling up\n   railroad ties, etc.'),
(18383, 'Cuddy', 'n.', 'A small cabin: also, the galley or kitchen of a vessel.'),
(18384, 'Cuddy', 'n.', 'The coalfish (Pollachius carbonarius).'),
(18385, 'Cudgel', 'n.', 'A staff used in cudgel play, shorter than the quarterstaff,\n   and wielded with one hand; hence, any heavy stick used as a weapon.'),
(18386, 'Cudgeled', 'imp. & p. p.', 'of Cudgel'),
(18387, 'Cudgel', 'v. t.', 'To beat with a cudgel.'),
(18388, 'Cudgeler', 'n.', 'One who beats with a cudgel.'),
(18389, 'Cudweed', 'n.', 'A small composite plant with cottony or silky stem and\n   leaves, primarily a species of Gnaphalium, but the name is now given to\n   many plants of different genera, as Filago, Antennaria, etc.;\n   cottonweed.'),
(18390, 'Cuerpo', 'n.', 'The body.'),
(18391, 'Cuffed', 'imp. & p. p.', 'of Cuff'),
(18392, 'Cuffing', 'p. pr. & vb. n.', 'of Cuff'),
(18393, 'Cuffy', 'n.', 'A name for a negro.'),
(18394, 'Cufic', 'a.', 'Of or pertaining to the older characters of the Arabic\n   language.'),
(18395, 'Cuinage', 'n.', 'The stamping of pigs of tin, by the proper officer, with\n   the arms of the duchy of Cornwall.'),
(18396, 'Cuirass', 'n.', 'A piece of defensive armor, covering the body from the\n   neck to the girdle'),
(18397, 'Cuirass', 'n.', 'The breastplate taken by itself.'),
(18398, 'Cuirass', 'n.', 'An armor of bony plates, somewhat resembling a cuirass.'),
(18399, 'Cuish', 'n.', 'Defensive armor for the thighs.'),
(18400, 'Cuisine', 'n.', 'The kitchen or cooking department.'),
(18401, 'Cuisine', 'n.', 'Manner or style of cooking.'),
(18402, 'Culasse', 'n.', 'The lower faceted portion of a brilliant-cut diamond.'),
(18403, 'Culdee', 'n.', 'One of a class of anchorites who lived in various parts of\n   Scotland, Ireland, and Wales.'),
