(18639, 'Curse', 'v. t.', 'The cause of great harm, evil, or misfortune; that which\n   brings evil or severe affliction; torment.'),
(18640, 'Cursed', 'a.', 'Deserving a curse; execrable; hateful; detestable;\n   abominable.'),
(18641, 'Cursedly', 'adv.', 'In a cursed manner; miserably; in a manner to be\n   detested; enormously.'),
(18642, 'Curser', 'n.', 'One who curses.'),
(18643, 'Curship', 'n.', 'The state of being a cur; one who is currish.'),
(18644, 'Cursitor', 'n.', 'A courier or runner.'),
(18645, 'Cursitor', 'n.', 'An officer in the Court of Chancery, whose business is to\n   make out original writs.'),
(18646, 'Cursive', 'a.', 'Running; flowing.'),
(18647, 'Cursive', 'n.', 'A character used in cursive writing.'),
(18648, 'Cursive', 'n.', 'A manuscript, especially of the New Testament, written in\n   small, connected characters or in a running hand; -- opposed to uncial.'),
(18649, 'Cursor', 'n.', 'Any part of a mathematical instrument that moves or slides\n   backward and forward upon another part.'),
(18650, 'Cursores', 'n. pl.', 'An order of running birds including the ostrich, emu,\n   and allies; the Ratitaae.'),
(18651, 'Cursores', 'n. pl.', 'A group of running spiders; the wolf spiders.'),
(18652, 'Cursory', 'a.', 'Running about; not stationary.'),
(18653, 'Cursory', 'a.', 'Characterized by haste; hastily or superficially\n   performed; slight; superficial; careless.'),
(18654, 'Curst', '', 'imp. & p. p. of Curse.'),
(18655, 'Curst', 'a.', 'Froward; malignant; mischievous; malicious; snarling.'),
(18656, 'Curtail', 'v. t.', 'To cut off the end or tail, or any part, of; to\n   shorten; to abridge; to diminish; to reduce.'),
(18657, 'Curtail', 'n.', 'The scroll termination of any architectural member, as of\n   a step, etc.'),
(18658, 'Curtain', 'n.', 'A hanging screen intended to darken or conceal, and\n   admitting of being drawn back or up, and reclosed at pleasure; esp.,\n   drapery of cloth or lace hanging round a bed or at a window; in\n   theaters, and like places, a movable screen for concealing the stage.'),
(18659, 'Curtain', 'n.', 'That part of the rampart and parapet which is between two\n   bastions or two gates. See Illustrations of Ravelin and Bastion.'),
(18660, 'Curtain', 'n.', 'That part of a wall of a building which is between two\n   pavilions, towers, etc.'),
(18661, 'Curtain', 'n.', 'A flag; an ensign; -- in contempt.'),
(18662, 'Curtain', 'v. t.', 'To inclose as with curtains; to furnish with curtains.'),
(18663, 'Curtal', 'a.', 'Curt; brief; laconic.'),
(18664, 'Curtal', 'n.', 'A horse with a docked tail; hence, anything cut short.'),
(18665, 'Curtana', 'n.', 'The pointless sword carried before English monarchs at\n   their coronation, and emblematically considered as the sword of mercy;\n   -- also called the sword of Edward the Confessor.'),
(18666, 'Curtate', 'a.', 'Shortened or reduced; -- said of the distance of a planet\n   from the sun or earth, as measured in the plane of the ecliptic, or the\n   distance from the sun or earth to that point where a perpendicular, let\n   fall from the planet upon the plane of the ecliptic, meets the\n   ecliptic.'),
(18667, 'Curtein', 'n.', 'Same as Curtana.'),
(18668, 'Curtes', 'a.', 'Courteous.'),
(18669, 'Curtesy', 'n.', 'the life estate which a husband has in the lands of his\n   deceased wife, which by the common law takes effect where he has had\n   issue by her, born alive, and capable of inheriting the lands.'),
(18670, 'Curtly', 'adv.', 'In a curt manner.'),
(18671, 'Curtness', 'n.', 'The quality of bing curt.'),
(18672, 'Curtsy', 'n.', 'Same as Courtesy, an act of respect.'),
(18673, 'Curule', 'a.', 'Of or pertaining to a chariot.'),
(18674, 'Curule', 'a.', 'Of or pertaining to a kind of chair appropriated to Roman\n   magistrates and dignitaries; pertaining to, having, or conferring, the\n   right to sit in the curule chair; hence, official.'),
(18675, 'Cururo', 'n.', 'A Chilian burrowing rodent of the genus Spalacopus.'),
(18676, 'Curval', 'p. pr.', 'Alt. of Curvant'),
(18677, 'Curvant', 'p. pr.', 'Bowed; bent; curved.'),
(18678, 'Curvate', 'a.', 'Alt. of Curvated'),
(18679, 'Curvated', 'a.', 'Bent in a regular form; curved.'),
(18680, 'Curve', 'a.', 'Bent without angles; crooked; curved; as, a curve line; a\n   curve surface.'),
(18681, 'Curve', 'a.', 'A bending without angles; that which is bent; a flexure; as,\n   a curve in a railway or canal.'),
(18682, 'Curve', 'a.', 'A line described according to some low, and having no finite\n   portion of it a straight line.'),
(18683, 'Curved', 'imp. & p. p.', 'of Curve'),
(18684, 'Curving', 'p. pr. & vb. n.', 'of Curve'),
(18685, 'Curve', 'a.', 'To bend; to crook; as, to curve a line; to curve a pipe; to\n   cause to swerve from a straight course; as, to curve a ball in pitching\n   it.'),
(18686, 'Curve', 'v. i.', 'To bend or turn gradually from a given direction; as, the\n   road curves to the right.'),
(18687, 'Curvet', 'n.', 'A particular leap of a horse, when he raises both his fore\n   legs at once, equally advanced, and, as his fore legs are falling,\n   raises his hind legs, so that all his legs are in the air at once.'),
(18688, 'Curvet', 'n.', 'A prank; a frolic.'),
(18689, 'Curveted', 'imp. & p. p.', 'of Curvet'),
(18690, '-vetted', '', 'of Curvet'),
(18691, '-vetting', '', 'of Curvet'),
(18692, 'Curvet', 'n.', 'To make a curvet; to leap; to bound.'),
(18693, 'Curvet', 'n.', 'To leap and frisk; to frolic.'),
(18694, 'Curvet', 'v. t.', 'To cause to curvet.'),
(18695, 'Curvity', 'n.', 'The state of being curved; a bending in a regular form;\n   crookedness.'),
(18696, 'Cushat', 'n.', 'The ringdove or wood pigeon.'),
(18697, 'Cushion', 'n.', 'A case or bag stuffed with some soft and elastic material,\n   and used to sit or recline upon; a soft pillow or pad.'),
(18698, 'Cushion', 'n.', 'Anything resembling a cushion in properties or use'),
(18699, 'Cushion', 'n.', 'a pad on which gilders cut gold leaf'),
(18700, 'Cushion', 'n.', 'a mass of steam in the end of the cylinder of a steam\n   engine to receive the impact of the piston'),
(18701, 'Cushion', 'n.', 'the elastic edge of a billiard table.'),
(18702, 'Cushion', 'n.', 'A riotous kind of dance, formerly common at weddings; --\n   called also cushion dance.'),
(18703, 'Cushion', 'v. t.', 'To seat or place on, or as on a cushion.'),
(18704, 'Cushion', 'v. t.', 'To furnish with cushions; as, to cushion a chaise.'),
(18705, 'Cushion', 'v. t.', 'To conceal or cover up, as under a cushion.'),
(18706, 'Cushiony', 'a.', 'Like a cushion; soft; pliable.'),
(18707, 'Cushite', 'n.', 'A descendant of Cush, the son of Ham and grandson of Noah.'),
(18708, 'Cuskin', 'n.', 'A kind of drinking cup.'),
(18709, 'Cusped', 'imp. & p. p.', 'of Cusp'),
(18710, 'Cusping', 'p. pr. & vb. n.', 'of Cusp'),
(18711, 'Cuspated', 'a.', 'Ending in a point.'),
(18712, 'Cuspid', 'n.', 'One of the canine teeth; -- so called from having but one\n   point or cusp on the crown. See Tooth.'),
(18713, 'Cuspidal', 'a.', 'Ending in a point.'),
(18714, 'Cuspidor', 'n.', 'Any ornamental vessel used as a spittoon; hence, to avoid\n   the common term, a spittoon of any sort.'),
(18715, 'Cuspis', 'n.', 'A point; a sharp end.'),
(18716, 'Custard', 'n.', 'A mixture of milk and eggs, sweetened, and baked or\n   boiled.'),
(18717, 'Custode', 'n.', 'See Custodian.'),
(18718, 'Custody', 'n.', 'A keeping or guarding; care, watch, inspection, for\n   keeping, preservation, or security.'),
(18719, 'Custody', 'n.', 'Judicial or penal safe-keeping.'),
(18720, 'Custody', 'n.', 'State of being guarded and watched to prevent escape;\n   restraint of liberty; confinement; imprisonment.'),
(18721, 'Custom', 'n.', 'Frequent repetition of the same act; way of acting common\n   to many; ordinary manner; habitual practice; usage; method of doing or\n   living.'),
(18722, 'Custom', 'n.', 'Habitual buying of goods; practice of frequenting, as a\n   shop, manufactory, etc., for making purchases or giving orders;\n   business support.'),
(18723, 'Custom', 'n.', 'Long-established practice, considered as unwritten law, and\n   resting for authority on long consent; usage. See Usage, and\n   Prescription.'),
(18724, 'Custom', 'n.', 'Familiar aquaintance; familiarity.'),
(18725, 'Custom', 'v. t.', 'To make familiar; to accustom.'),
(18726, 'Custom', 'v. t.', 'To supply with customers.'),
(18727, 'Custom', 'v. i.', 'To have a custom.'),
(18728, 'Custom', 'n.', 'The customary toll, tax, or tribute.'),
(18729, 'Custom', 'n.', 'Duties or tolls imposed by law on commodities, imported or\n   exported.'),
(18730, 'Custom', 'v. t.', 'To pay the customs of.'),
(18731, 'Customer', 'n.', 'One who collect customs; a toll gatherer.'),
(18732, 'Customer', 'n.', 'One who regularly or repeatedly makes purchases of a\n   trader; a purchaser; a buyer.'),
(18733, 'Customer', 'n.', 'A person with whom a business house has dealings; as, the\n   customers of a bank.'),
(18734, 'Customer', 'n.', 'A peculiar person; -- in an indefinite sense; as, a queer\n   customer; an ugly customer.'),
(18735, 'Customer', 'n.', 'A lewd woman.'),
(18736, 'Custodes', 'pl. ', 'of Custos'),
(18737, 'Custos', 'n.', 'A keeper; a custodian; a superintendent.'),
(18738, 'Custrel', 'n.', 'An armor-bearer to a knight.'),
(18739, 'Custrel', 'n.', 'See Costrel.'),
(18740, 'Cutting', 'p. pr. & vb. n.', 'of Cut'),
(18741, 'Cutaway', 'a.', 'Having a part cut off or away; having the corners rounded\n   or cut away.'),
(18742, 'Cutch', 'n.', 'See Catechu.'),
(18743, 'Cutch', 'n.', 'See Cultch.'),
(18744, 'Cutchery', 'n.', 'A hindoo hall of justice.'),
(18745, 'Cuteness', 'n.', 'Acuteness; cunning.'),
(18746, 'Cutgrass', '', 'A grass with leaves having edges furnished with very minute\n   hooked prickles, which form a cutting edge; one or more species of\n   Leersia.'),
(18747, 'Cuticle', 'n.', 'The scarfskin or epidermis. See Skin.'),
(18748, 'Cuticle', 'n.', 'The outermost skin or pellicle of a plant, found\n   especially in leaves and young stems.'),
(18749, 'Cuticle', 'n.', 'A thin skin formed on the surface of a liquid.'),
(18750, 'Cutin', 'n.', 'The substance which, added to the material of a cell wall,\n   makes it waterproof, as in cork.'),
(18751, 'Cutinize', 'v. t. & i.', 'To change into cutin.'),
(18752, 'Cutis', 'n.', 'See Dermis.'),
(18753, 'Cutlass', 'n.', 'A short, heavy, curving sword, used in the navy. See\n   Curtal ax.'),
(18754, 'Cutler', 'n.', 'One who makes or deals in cutlery, or knives and other\n   cutting instruments.'),
(18755, 'Cutlery', 'n.', 'The business of a cutler.'),
(18756, 'Cutlery', 'n.', 'Edged or cutting instruments, collectively.'),
(18757, 'Cutlet', 'n.', 'A piece of meat, especially of veal or mutton, cut for\n   broiling.'),
(18758, 'Cutling', 'n.', 'The art of making edged tools or cutlery.'),
(18759, 'Cut-off', 'n.', 'That which cuts off or shortens, as a nearer passage or\n   road.'),
(18760, 'Cut-off', 'n.', 'The valve gearing or mechanism by which steam is cut off\n   from entering the cylinder of a steam engine after a definite point in\n   a stroke, so as to allow the remainder of the stroke to be made by the\n   expansive force of the steam already let in. See Expansion gear, under\n   Expansion.'),
(18761, 'Cut-off', 'n.', 'Any device for stopping or changing a current, as of grain\n   or water in a spout.'),
(18762, 'Cutose', 'n.', 'A variety of cellulose, occuring as a fine transparent\n   membrane covering the aerial organs of plants, and forming an essential\n   ingredient of cork; by oxidation it passes to suberic acid.'),
(18763, 'Cut-out', 'n.', 'A species of switch for changing the current from one\n   circuit to another, or for shortening a circuit.'),
(18764, 'Cut-out', 'n.', 'A device for breaking or separating a portion of circuit.'),
(18765, 'Cutpurse', 'n.', 'One who cuts purses for the sake of stealing them or\n   their contents (an act common when men wore purses fastened by a string\n   to their girdles); one who steals from the person; a pickpocket'),
(18766, 'Cutter', 'n.', 'One who cuts; as, a stone cutter; a die cutter; esp., one\n   who cuts out garments.'),
(18767, 'Cutter', 'n.', 'That which cuts; a machine or part of a machine, or a tool\n   or instrument used for cutting, as that part of a mower which severs\n   the stalk, or as a paper cutter.'),
(18768, 'Cutter', 'n.', 'A fore tooth; an incisor.'),
(18769, 'Cutter', 'n.', 'A boat used by ships of war.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(18770, 'Cutter', 'n.', 'A fast sailing vessel with one mast, rigged in most\n   essentials like a sloop. A cutter is narrower end deeper than a sloop\n   of the same length, and depends for stability on a deep keel, often\n   heavily weighted with lead.'),
(18771, 'Cutter', 'n.', 'A small armed vessel, usually a steamer, in the revenue\n   marine service; -- also called revenue cutter.'),
(18772, 'Cutter', 'n.', 'A small, light one-horse sleigh.'),
(18773, 'Cutter', 'n.', 'An officer in the exchequer who notes by cutting on the\n   tallies the sums paid.'),
(18774, 'Cutter', 'n.', 'A ruffian; a bravo; a destroyer.'),
(18775, 'Cutter', 'n.', 'A kind of soft yellow brick, used for facework; -- so\n   called from the facility with which it can be cut.'),
(18776, 'Cutting', 'n.', 'The act or process of making an incision, or of severing,\n   felling, shaping, etc.'),
(18777, 'Cutting', 'n.', 'Something cut, cut off, or cut out, as a twig or scion cut\n   off from a stock for the purpose of grafting or of rooting as an\n   independent plant; something cut out of a newspaper; an excavation cut\n   through a hill or elsewhere to make a way for a railroad, canal, etc.;\n   a cut.'),
(18778, 'Cutting', 'a.', 'Adapted to cut; as, a cutting tool.'),
(18779, 'Cutting', 'a.', 'Chilling; penetrating; sharp; as, a cutting wind.'),
(18780, 'Cutting', 'a.', 'Severe; sarcastic; biting; as, a cutting reply.'),
(18781, 'Cuttle', 'n.', 'A knife.'),
(18782, 'Cuttle', 'n.', 'Alt. of Cuttlefish'),
(18783, 'Cytty', 'a.', 'Short; as, a cutty knife; a cutty sark.'),
(18784, 'Cutty', 'n.', 'A short spoon.'),
(18785, 'Cutty', 'n.', 'A short tobacco pipe.'),
(18786, 'Cutty', 'n.', 'A light or unchaste woman.'),
(18787, 'Cutwal', 'n.', 'The chief police officer of a large city.'),
(18788, 'Cutwater', 'n.', 'The fore part of a ship\'s prow, which cuts the water.'),
(18789, 'Cutwater', 'n.', 'A starling or other structure attached to the pier of a\n   bridge, with an angle or edge directed up stream, in order better to\n   resist the action of water, ice, etc.; the sharpened upper end of the\n   pier itself.'),
(18790, 'Cutwater', 'n.', 'A sea bird of the Atlantic (Rhynchops nigra); -- called\n   also black skimmer, scissorsbill, and razorbill. See Skimmer.'),
(18791, 'Cutwork', 'n.', 'An ancient term for embroidery, esp. applied to the\n   earliest form of lace, or to that early embroidery on linen and the\n   like, from which the manufacture of lace was developed.'),
(18792, 'Cutworm', 'n.', 'A caterpillar which at night eats off young plants of\n   cabbage, corn, etc., usually at the ground. Some kinds ascend fruit\n   trees and eat off the flower buds. During the day, they conceal\n   themselves in the earth. The common cutworms are the larvae of various\n   species of Agrotis and related genera of noctuid moths.'),
(18793, 'Cuvette', 'n.', 'A pot, bucket, or basin, in which molten plate glass is\n   carried from the melting pot to the casting table.'),
(18794, 'Cuvette', 'n.', 'A cunette.'),
(18795, 'Cuvette', 'n.', 'A small vessel with at least two flat and transparent\n   sides, used to hold a liquid sample to be analysed in the light path of\n   a spectrometer.'),
(18796, 'Cyanate', 'n.', 'A salt of cyanic acid.'),
(18797, 'Cyanean', 'a.', 'Having an azure color.'),
(18798, 'Cyanic', 'a.', 'Pertaining to, or containing, cyanogen.'),
(18799, 'Cyanic', 'a.', 'Of or pertaining to a blue color.'),
(18800, 'Cyanide', 'n.', 'A compound formed by the union of cyanogen with an element\n   or radical.'),
(18801, 'Cyanin', 'n.', 'The blue coloring matter of flowers; -- called also\n   anthokyan and anthocyanin.'),
(18802, 'Cyanine', 'n.', 'One of a series of artificial blue or red dyes obtained\n   from quinoline and lepidine and used in calico printing.'),
(18803, 'Cyanite', 'n.', 'A mineral occuring in thin-bladed crystals and crystalline\n   aggregates, of a sky-blue color. It is a silicate of aluminium.'),
(18804, 'Cyanogen', 'n.', 'A colorless, inflammable, poisonous gas, C2N2, with a\n   peach-blossom odor, so called from its tendency to form blue compounds;\n   obtained by heating ammonium oxalate, mercuric cyanide, etc. It is\n   obtained in combination, forming an alkaline cyanide when nitrogen or a\n   nitrogenous compound is strongly ignited with carbon and soda or\n   potash. It conducts itself like a member of the halogen group of\n   elements, and shows a tendency to form complex compounds. The name is\n   also applied to the univalent radical, CN (the half molecule of\n   cyanogen proper), which was one of the first compound radicals\n   recognized.'),
(18805, 'Cyanosed', 'a.', 'Rendered blue, as the surface of the body, from cyanosis\n   or deficient a/ration of the blood.'),
(18806, 'Cyanosis', 'n.', 'A condition in which, from insufficient a/ration of the\n   blood, the surface of the body becomes blue. See Cyanopathy.'),
(18807, 'Cyanotic', 'a.', 'Relating to cyanosis; affected with cyanosis; as, a\n   cyanotic patient; having the hue caused by cyanosis; as, a cyanotic\n   skin.'),
(18808, 'Cyanuret', 'n.', 'A cyanide.'),
(18809, 'Cyanuric', 'a.', 'Pertaining to, or derived from, cyanic and uric acids.'),
(18810, 'Cycad', 'n.', 'Any plant of the natural order Cycadaceae, as the sago palm,\n   etc.'),
(18811, 'Cycas', 'n.', 'A genus of trees, intermediate in character between the\n   palms and the pines. The pith of the trunk of some species furnishes a\n   valuable kind of sago.'),
(18812, 'Cyclamen', 'n.', 'A genus of plants of the Primrose family, having\n   depressed rounded corms, and pretty nodding flowers with the petals so\n   reflexed as to point upwards, whence it is called rabbits\' ears. It is\n   also called sow bread, because hogs are said to eat the corms.'),
(18813, 'Cyclamin', 'n.', 'A white amorphous substance, regarded as a glucoside,\n   extracted from the corm of Cyclamen Europaeum.'),
(18814, 'Cyclas', 'n.', 'A long gown or surcoat (cut off in front), worn in the\n   Middle Ages. It was sometimes embroidered or interwoven with gold.\n   Also, a rich stuff from which the gown was made.'),
(18815, 'Cycle', 'n.', 'An imaginary circle or orbit in the heavens; one of the\n   celestial spheres.'),
(18816, 'Cycle', 'n.', 'An interval of time in which a certain succession of events\n   or phenomena is completed, and then returns again and again, uniformly\n   and continually in the same order; a periodical space of time marked by\n   the recurrence of something peculiar; as, the cycle of the seasons, or\n   of the year.'),
(18817, 'Cycle', 'n.', 'An age; a long period of time.'),
(18818, 'Cycle', 'n.', 'An orderly list for a given time; a calendar.'),
(18819, 'Cycle', 'n.', 'The circle of subjects connected with the exploits of the\n   hero or heroes of some particular period which have served as a popular\n   theme for poetry, as the legend of Arthur and the knights of the Round\n   Table, and that of Charlemagne and his paladins.'),
(18820, 'Cycle', 'n.', 'One entire round in a circle or a spire; as, a cycle or set\n   of leaves.'),
(18821, 'Cycle', 'n.', 'A bicycle or tricycle, or other light velocipede.'),
(18822, 'Cycled', 'imp. & p. p.', 'of Cycle'),
(18823, 'Cycling', 'p. pr. & vb. n.', 'of Cycle'),
(18824, 'Cycle', 'v. i.', 'To pass through a cycle of changes; to recur in cycles.'),
(18825, 'Cycle', 'v. i.', 'To ride a bicycle, tricycle, or other form of cycle.'),
(18826, 'Cyclic', 'a.', 'Alt. of Cyclical'),
(18827, 'Cyclical', 'a.', 'Of or pertaining to a cycle or circle; moving in cycles;\n   as, cyclical time.'),
(18828, 'Cyclide', 'n.', 'A surface of the fourth degree, having certain special\n   relations to spherical surfaces. The tore or anchor ring is one of the\n   cyclides.'),
(18829, 'Cycling', 'n.', 'The act, art, or practice, of riding a cycle, esp. a\n   bicycle or tricycle.'),
(18830, 'Cyclist', 'n.', 'A cycler.'),
(18831, 'Cyclo-', '', 'A combining form meaning circular, of a circle or wheel.'),
(18832, 'Cycloid', 'n.', 'A curve generated by a point in the plane of a circle when\n   the circle is rolled along a straight line, keeping always in the same\n   plane.'),
(18833, 'Cycloid', 'a.', 'Of or pertaining to the Cycloidei.'),
(18834, 'Cycloid', 'n.', 'One of the Cycloidei.'),
(18835, 'Cyclone', 'n.', 'A violent storm, often of vast extent, characterized by\n   high winds rotating about a calm center of low atmospheric pressure.\n   This center moves onward, often with a velocity of twenty or thirty\n   miles an hour.'),
(18836, 'Cyclonic', 'a.', 'Pertaining to a cyclone.'),
(18837, 'Cyclop', 'n.', 'See Note under Cyclops, 1.'),
(18838, 'Cyclopic', 'a.', 'Pertaining to the Cyclops; Cyclopean.'),
(18839, 'Cyclops', 'n. sing. & pl.', 'One of a race of giants, sons of Neptune and\n   Amphitrite, having but one eye, and that in the middle of the forehead.\n   They were fabled to inhabit Sicily, and to assist in the workshops of\n   Vulcan, under Mt. Etna.'),
(18840, 'Cyclops', 'n. sing. & pl.', 'A genus of minute Entomostraca, found both in\n   fresh and salt water. See Copepoda.'),
(18841, 'Cyclops', 'n. sing. & pl.', 'A portable forge, used by tinkers, etc.'),
(18842, 'Cyclosis', 'n.', 'The circulation or movement of protoplasmic granules\n   within a living vegetable cell.'),
(18843, 'Cyder', 'n.', 'See Cider.'),
(18844, 'Cydonin', 'n.', 'A peculiar mucilaginous substance extracted from the seeds\n   of the quince (Cydonia vulgaris), and regarded as a variety of amylose.'),
(18845, 'Cygnet', 'n.', 'A young swan.'),
(18846, 'Cygnus', 'n.', 'A constellation of the northern hemisphere east of, or\n   following, Lyra; the Swan.'),
(18847, 'Cylinder', 'n.', 'A solid body which may be generated by the rotation of a\n   parallelogram round one its sides; or a body of rollerlike form, of\n   which the longitudinal section is oblong, and the cross section is\n   circular.'),
(18848, 'Cylinder', 'n.', 'The space inclosed by any cylindrical surface. The space\n   may be limited or unlimited in length.'),
(18849, 'Cylinder', 'n.', 'Any hollow body of cylindrical form'),
(18850, 'Cylinder', 'n.', 'The chamber of a steam engine in which the piston is\n   moved by the force of steam.'),
(18851, 'Cylinder', 'n.', 'The barrel of an air or other pump.'),
(18852, 'Cylinder', 'n.', 'The revolving platen or bed which produces the impression\n   or carries the type in a cylinder press.'),
(18853, 'Cylinder', 'n.', 'The bore of a gun; the turning chambered breech of a\n   revolver.'),
(18854, 'Cylinder', 'n.', 'The revolving square prism carrying the cards in a\n   Jacquard loom.'),
(18855, 'Cymar', 'n.', 'A slight covering; a scarf. See Simar.'),
(18856, 'Cymatium', 'n.', 'A capping or crowning molding in classic architecture.'),
(18857, 'Cymbal', 'n.', 'A musical instrument used by the ancients. It is supposed\n   to have been similar to the modern kettle drum, though perhaps smaller.'),
(18858, 'Cymbal', 'n.', 'A musical instrument of brass, shaped like a circular dish\n   or a flat plate, with a handle at the back; -- used in pairs to produce\n   a sharp ringing sound by clashing them together.'),
(18859, 'Cymbal', 'n.', 'A musical instrument used by gypsies and others, made of\n   steel wire, in a triangular form, on which are movable rings.'),
(18860, 'Cymbium', 'n.', 'A genus of marine univalve shells; the gondola.'),
(18861, 'Cymene', 'n.', 'A colorless, liquid, combustible hydrocarbon,\n   CH3.C6H4.C3H7, of pleasant odor, obtained from oil of cumin, oil of\n   caraway, carvacrol, camphor, etc.; -- called also paracymene, and\n   formerly camphogen.'),
(18862, 'Cymenol', 'n.', 'See Carvacrol.'),
(18863, 'Cymidine', 'n.', 'A liquid organic base, C10H13.NH2, derived from cymene.'),
(18864, 'Cymling', 'n.', 'Alt. of Cymbling'),
(18865, 'Cymbling', 'n.', 'A scalloped or \"pattypan\" variety of summer squash.'),
(18866, 'Cymogene', 'n.', 'A highly volatile liquid, condensed by cold and pressure\n   from the first products of the distillation of petroleum; -- used for\n   producing low temperatures.'),
(18867, 'Cymoid', 'a.', 'Having the form of a cyme.'),
(18868, 'Cymose', 'a.', 'Alt. of Cymous'),
(18869, 'Cymous', 'a.', 'Having the nature of a cyme, or derived from a cyme;\n   bearing, or pertaining to, a cyme or cymes.'),
(18870, 'Cymric', 'a.', 'Welsh.'),
(18871, 'Cymric', 'n.', 'The Welsh language.'),
(18872, 'Cymry', 'n.', 'A collective term for the Welsh race; -- so called by\n   themselves .'),
(18873, 'Cymule', 'n.', 'A small cyme, or one of very few flowers.'),
(18874, 'Cynanche', 'n.', 'Any disease of the tonsils, throat, or windpipe, attended\n   with inflammation, swelling, and difficulty of breathing and\n   swallowing.'),
(18875, 'Cynic', 'a.', 'Alt. of Cynical'),
(18876, 'Cynical', 'a.', 'Having the qualities of a surly dog; snarling; captious;\n   currish.'),
(18877, 'Cynical', 'a.', 'Pertaining to the Dog Star; as, the cynic, or Sothic,\n   year; cynic cycle.'),
(18878, 'Cynical', 'a.', 'Belonging to the sect of philosophers called cynics;\n   having the qualities of a cynic; pertaining to, or resembling, the\n   doctrines of the cynics.'),
(18879, 'Cynical', 'a.', 'Given to sneering at rectitude and the conduct of life by\n   moral principles; disbelieving in the reality of any human purposes\n   which are not suggested or directed by self-interest or\n   self-indulgence; as, a cynical man who scoffs at pretensions of\n   integrity; characterized by such opinions; as, cynical views of human\n   nature.'),
(18880, 'Cynic', 'n.', 'One of a sect or school of philosophers founded by\n   Antisthenes, and of whom Diogenes was a disciple. The first Cynics were\n   noted for austere lives and their scorn for social customs and current\n   philosophical opinions. Hence the term Cynic symbolized, in the popular\n   judgment, moroseness, and contempt for the views of others.'),
(18881, 'Cynic', 'n.', 'One who holds views resembling those of the Cynics; a\n   snarler; a misanthrope; particularly, a person who believes that human\n   conduct is directed, either consciously or unconsciously, wholly by\n   self-interest or self-indulgence, and that appearances to the contrary\n   are superficial and untrustworthy.'),
(18882, 'Cynicism', 'n.', 'The doctrine of the Cynics; the quality of being cynical;\n   the mental state, opinions, or conduct, of a cynic; morose and\n   contemptuous views and opinions.'),
(18883, 'Cynoidea', 'n. pl.', 'A division of Carnivora, including the dogs, wolves,\n   and foxes.'),
(18884, 'Cynosure', 'n.', 'The constellation of the Lesser Bear, to which, as\n   containing the polar star, the eyes of mariners and travelers were\n   often directed.'),
(18885, 'Cynosure', 'n.', 'That which serves to direct.'),
(18886, 'Cynosure', 'n.', 'Anything to which attention is strongly turned; a center\n   of attraction.'),
(18887, 'Cyperus', 'n.', 'A large genus of plants belonging to the Sedge family, and\n   including the species called galingale, several bulrushes, and the\n   Egyptian papyrus.'),
(18888, 'Cypher', 'n. & v.', 'See Cipher.'),
(18889, 'Cypraea', 'n.', 'A genus of mollusks, including the cowries. See Cowrie.'),
(18890, 'Cypres', 'n.', 'A rule for construing written instruments so as to conform\n   as nearly to the intention of the parties as is consistent with law.'),
(18891, 'Cypress', 'n.', 'A coniferous tree of the genus Cupressus. The species are\n   mostly evergreen, and have wood remarkable for its durability.'),
(18892, 'Cyprian', 'a.', 'Belonging to Cyprus.'),
(18893, 'Cyprian', 'a.', 'Of, pertaining, or conducing to, lewdness.'),
(18894, 'Cyprian', 'n.', 'A native or inhabitant of Cyprus, especially of ancient\n   Cyprus; a Cypriot.'),
(18895, 'Cyprian', 'n.', 'A lewd woman; a harlot.'),
(18896, 'Cyprine', 'a.', 'Of or pertaining to the cypress.'),
(18897, 'Cyprine', 'a.', 'Cyprinoid.'),
(18898, 'Cypriot', 'n.', 'A native or inhabitant of Cyprus.'),
(18899, 'Cyprides', 'pl. ', 'of Cypris'),
(18900, 'Cypris', 'n.', 'A genus of small, bivalve, fresh-water Crustacea, belonging\n   to the Ostracoda; also, a member of this genus.'),
(18901, 'Cyprus', 'n.', 'A thin, transparent stuff, the same as, or corresponding\n   to, crape. It was either white or black, the latter being most common,\n   and used for mourning.'),
(18902, 'Cypsela', 'n.', 'A one-seeded, one-celled, indehiscent fruit; an achene\n   with the calyx tube adherent.'),
(18903, 'Cyrenaic', 'a.', 'Pertaining to Cyrenaica, an ancient country of northern\n   Africa, and to Cyrene, its principal city; also, to a school of\n   philosophy founded by Aristippus, a native of Cyrene.'),
(18904, 'Cyrenaic', 'n.', 'A native of Cyrenaica; also, a disciple of the school of\n   Aristippus. See Cyrenian, n.'),
(18905, 'Cyrenian', 'a.', 'Pertaining to Cyrene, in Africa; Cyrenaic.'),
(18906, 'Cyrenian', 'n.', 'A native or inhabitant of Cyrene.'),
(18907, 'Cyrenian', 'n.', 'One of a school of philosophers, established at Cyrene by\n   Aristippus, a disciple of Socrates. Their doctrines were nearly the\n   same as those of the Epicureans.'),
(18908, 'Cysted', 'a.', 'Inclosed in a cyst.'),
(18909, 'Cystic', 'a.', 'Having the form of, or living in, a cyst; as, the cystic\n   entozoa.'),
(18910, 'Cystic', 'a.', 'Containing cysts; cystose; as, cystic sarcoma.'),
(18911, 'Cystic', 'a.', 'Pertaining to, or contained in, a cyst; esp., pertaining\n   to, or contained in, either the urinary bladder or the gall bladder.'),
(18912, 'Cystid', 'n.', 'One of the Cystidea.'),
(18913, 'Cystidea', 'n. pl.', 'An order of Crinoidea, mostly fossils of the\n   Paleozoic rocks. They were usually roundish or egg-shaped, and often\n   unsymmetrical; some were sessile, others had short stems.'),
(18914, 'Cystine', 'n.', 'A white crystalline substance, C3H7NSO2, containing\n   sulphur, occuring as a constituent of certain rare urinary calculi, and\n   occasionally found as a sediment in urine.'),
(18915, 'Cystis', 'n.', 'A cyst. See Cyst.'),
(18916, 'Cystitis', 'n.', 'Inflammation of the bladder.'),
(18917, 'Cystoid', 'n.', 'Alt. of Cystoidean'),
(18918, 'Cystose', 'a.', 'Containing, or resembling, a cyst or cysts; cystic;\n   bladdery.'),
(18919, 'Cytode', 'n.', 'A nonnucleated mass of protoplasm, the supposed simplest\n   form of independent life differing from the amoeba, in which nuclei are\n   present.'),
(18920, 'Cytogeny', 'n .', 'Cell production or development; cytogenesis.'),
(18921, 'Cytoid', 'a.', 'Cell-like; -- applied to the corpuscles of lymph, blood,\n   chyle, etc.'),
(18922, 'Cytula', 'n.', 'The fertilized egg cell or parent cell, from the\n   development of which the child or other organism is formed.'),
(18923, 'Czarevna', 'n.', 'The title of the wife of the czarowitz.'),
(18924, 'Czarina', 'n.', 'The title of the empress of Russia.'),
(18925, 'Czarish', 'a.', 'Of or pertaining to the czar.'),
(18926, 'Czech', 'n.', 'One of the Czechs.'),
(18927, 'Czech', 'n.', 'The language of the Czechs (often called Bohemian), the\n   harshest and richest of the Slavic languages.'),
(18928, 'Czechic', 'a.', 'Of or pertaining to the Czechs.'),
(18929, 'Czechs', 'n. pl.', 'The most westerly branch of the great Slavic family of\n   nations, numbering now more than 6,000,000, and found principally in\n   Bohemia and Moravia.\n   D () The fourth letter of the English alphabet, and a vocal consonant.\n   The English letter is from Latin, which is from Greek, which took it\n   from Ph/nician, the probable ultimate origin being Egyptian. It is\n   related most nearly to t and th; as, Eng. deep, G. tief; Eng. daughter,\n   G. tochter, Gr. qyga`thr, Skr. duhitr. See Guide to Pronunciation,\n   Ã178, 179, 229.'),
(18930, 'Dabbed', 'imp. & p. p.', 'of Dab'),
(18931, 'Dabbing', 'p. pr. & vb. n.', 'of Dab'),
(18932, 'Dabber', 'n.', 'That with which one dabs; hence, a pad or other device used\n   by printers, engravers, etc., as for dabbing type or engraved plates\n   with ink.'),
(18933, 'Dabbled', 'imp. & p. p.', 'of Dabble'),
(18934, 'Dabbling', 'p. pr. & vb. n.', 'of Dabble'),
(18935, 'Dabble', 'v. t.', 'To wet by little dips or strokes; to spatter; to\n   sprinkle; to moisten; to wet.'),
(18936, 'Dabble', 'v. i.', 'To play in water, as with the hands; to paddle or splash\n   in mud or water.'),
(18937, 'Dabble', 'v. i.', 'To work in slight or superficial manner; to do in a\n   small way; to tamper; to meddle.'),
(18938, 'Dabbler', 'n.', 'One who dabbles.'),
(18939, 'Dabbler', 'n.', 'One who dips slightly into anything; a superficial\n   meddler.'),
(18940, 'Dabchick', 'n.', 'A small water bird (Podilymbus podiceps), allied to the\n   grebes, remarkable for its quickness in diving; -- called also\n   dapchick, dobchick, dipchick, didapper, dobber, devil-diver,\n   hell-diver, and pied-billed grebe.'),
(18941, 'Daboia', 'n.', 'A large and highly venomous Asiatic viper (Daboia\n   xanthica).'),
(18942, 'Dabster', 'n.', 'One who is skilled; a master of his business; a\n   proficient; an adept.'),
(18943, 'Dacapo', '', 'From the beginning; a direction to return to, and end with,\n   the first strain; -- indicated by the letters D. C. Also, the strain so\n   repeated.'),
(18944, 'Dacian', 'a.', 'Of or pertaining to Dacia or the Dacians.'),
(18945, 'Dacian', 'n.', 'A native of ancient Dacia.'),
(18946, 'Dacoit', 'n.', 'One of a class of robbers, in India, who act in gangs.'),
(18947, 'Dacoity', 'n.', 'The practice of gang robbery in India; robbery committed\n   by dacoits.'),
(18948, 'Dacotahs', 'n. pl.', 'Same as Dacotas.'),
(18949, 'Dactyl', 'n.', 'A poetical foot of three sylables (-- ~ ~), one long\n   followed by two short, or one accented followed by two unaccented; as,\n   L. tegm/n/, E. mer\\b6ciful; -- so called from the similarity of its\n   arrangement to that of the joints of a finger.'),
(18950, 'Dactyl', 'n.', 'A finger or toe; a digit.'),
(18951, 'Dactyl', 'n.', 'The claw or terminal joint of a leg of an insect or\n   crustacean.'),
(18952, 'Dactylar', 'a.', 'Pertaining to dactyl; dactylic.'),
(18953, 'Dactylar', 'a.', 'Of or pertaining to a finger or toe, or to the claw of an\n   insect crustacean.'),
(18954, 'Dactylet', 'n.', 'A dactyl.'),
(18955, 'Dactylic', 'a.', 'Pertaining to, consisting chiefly or wholly of, dactyls;\n   as, dactylic verses.'),
(18956, 'Dactylic', 'n.', 'A line consisting chiefly or wholly of dactyls; as, these\n   lines are dactylics.'),
(18957, 'Dactylic', 'n.', 'Dactylic meters.'),
(18958, 'Daddled', 'imp. & p. p.', 'of Dadle'),
(18959, 'Daddling', 'p. pr. & vb. n.', 'of Dadle'),
(18960, 'Dadle', 'v. i.', 'To toddle; to walk unsteadily, like a child or an old\n   man; hence, to do anything slowly or feebly.'),
(18961, 'Daddock', 'n.', 'The rotten body of a tree.'),
(18962, 'Daddy', 'n.', 'Diminutive of Dad.'),
(18963, 'Dadoes', 'pl. ', 'of Dado'),
(18964, 'Daedal', 'a.', 'Alt. of Daedalian'),
(18965, 'Daemon', 'a.', 'Alt. of Daemonic'),
(18966, 'Daemonic', 'a.', 'See Demon, Demonic.'),
(18967, 'Daffodil', 'n.', 'A plant of the genus Asphodelus.'),
(18968, 'Daffodil', 'n.', 'A plant of the genus Narcissus (N. Pseudo-narcissus). It\n   has a bulbous root and beautiful flowers, usually of a yellow hue.\n   Called also daffodilly, daffadilly, daffadowndilly, daffydowndilly,\n   etc.'),
(18969, 'Daftness', 'n.', 'The quality of being daft.'),
(18970, 'Dagger', 'n.', 'A short weapon used for stabbing. This is the general term:\n   cf. Poniard, Stiletto, Bowie knife, Dirk, Misericorde, Anlace.'),
(18971, 'Dagger', 'n.', 'A mark of reference in the form of a dagger [/]. It is the\n   second in order when more than one reference occurs on a page; --\n   called also obelisk.'),
(18972, 'Dagger', 'v. t.', 'To pierce with a dagger; to stab.'),
(18973, 'Dagger', 'n.', 'A timber placed diagonally in a ship\'s frame.'),
(18974, 'Dagges', 'n. pl.', 'An ornamental cutting of the edges of garments,\n   introduced about a. d. 1346, according to the Chronicles of St Albans.'),
(18975, 'Daggled', 'imp. & p. p.', 'of Daggle'),
(18976, 'Daggling', 'p. pr. & vb. n.', 'of Daggle'),
(18977, 'Daggle', 'v. t.', 'To trail, so as to wet or befoul; to make wet and limp;\n   to moisten.'),
(18978, 'Daggle', 'v. i.', 'To run, go, or trail one\'s self through water, mud, or\n   slush; to draggle.'),
(18979, 'Daglock', 'n.', 'A dirty or clotted lock of wool on a sheep; a taglock.'),
(18980, 'Dagos', 'pl. ', 'of Dago'),
(18981, 'Dagoba', 'n.', 'A dome-shaped structure built over relics of Buddha or some\n   Buddhist saint.'),
(18982, 'Dagon', '', 'The national god of the Philistines, represented with the face\n   and hands and upper part of a man, and the tail of a fish.'),
(18983, 'Dagon', 'n.', 'A slip or piece.'),
(18984, 'Dagswain', 'n.', 'A coarse woolen fabric made of daglocks, or the refuse of\n   wool.'),
(18985, 'Dahabeah', 'n.', 'A Nile boat constructed on the model of a floating house,\n   having large lateen sails.'),
(18986, 'Dahlias', 'pl. ', 'of Dahlia'),
(18987, 'Dahlia', 'n.', 'A genus of plants native to Mexico and Central America, of\n   the order Compositae; also, any plant or flower of the genus. The\n   numerous varieties of cultivated dahlias bear conspicuous flowers which\n   differ in color.'),
(18988, 'Dahlin', 'n.', 'A variety of starch extracted from the dahlia; -- called\n   also inulin. See Inulin.'),
(18989, 'Daily', 'a.', 'Happening, or belonging to, each successive day; diurnal;\n   as, daily labor; a daily bulletin.'),
(18990, 'Dailies', 'pl. ', 'of Daily'),
(18991, 'Daily', 'n.', 'A publication which appears regularly every day; as, the\n   morning dailies.'),
(18992, 'Daily', 'adv.', 'Every day; day by day; as, a thing happens daily.'),
(18993, 'Daimios', 'pl. ', 'of Daimio'),
(18994, 'Daimio', 'n.', 'The title of the feudal nobles of Japan.'),
(18995, 'Daint', 'n.', 'Something of exquisite taste; a dainty.'),
(18996, 'Daint', 'a.', 'Dainty.'),
(18997, 'Daintify', 'v. t.', 'To render dainty, delicate, or fastidious.'),
(18998, 'Daintily', 'adv.', 'In a dainty manner; nicely; scrupulously; fastidiously;\n   deliciously; prettily.'),
(18999, 'Daintrel', 'n.', 'Adelicacy.'),
(19000, 'Dainties', 'pl. ', 'of Dainty'),
(19001, 'Dainty', 'n.', 'Value; estimation; the gratification or pleasure taken in\n   anything.'),
(19002, 'Dainty', 'n.', 'That which is delicious or delicate; a delicacy.'),
(19003, 'Dainty', 'n.', 'A term of fondness.'),
(19004, 'Dainty', 'superl.', 'Rare; valuable; costly.'),
(19005, 'Dainty', 'superl.', 'Delicious to the palate; toothsome.'),
(19006, 'Dainty', 'superl.', 'Nice; delicate; elegant, in form, manner, or breeding;\n   well-formed; neat; tender.'),
(19007, 'Dainty', 'superl.', 'Requiring dainties. Hence: Overnice; hard to please;\n   fastidious; squeamish; scrupulous; ceremonious.'),
(19008, 'Dairies', 'pl. ', 'of Dairy'),
(19009, 'Dairy', 'n.', 'The place, room, or house where milk is kept, and converted\n   into butter or cheese.'),
(19010, 'Dairy', 'n.', 'That department of farming which is concerned in the\n   production of milk, and its conversion into butter and cheese.'),
(19011, 'Dairy', 'n.', 'A dairy farm.'),
(19012, 'Dairying', 'n.', 'The business of conducting a dairy.'),
(19013, 'Dairymen', 'pl. ', 'of Dairyman'),
(19014, 'Dairyman', 'n.', 'A man who keeps or takes care of a dairy.'),
(19015, 'Daisied', 'a.', 'Full of daisies; adorned with daisies.'),
(19016, 'Daisies', 'pl. ', 'of Daisy'),
(19017, 'Daisy', 'n.', 'A genus of low herbs (Bellis), belonging to the family\n   Compositae. The common English and classical daisy is B. prennis, which\n   has a yellow disk and white or pinkish rays.'),
(19018, 'Daisy', 'n.', 'The whiteweed (Chrysanthemum Leucanthemum), the plant\n   commonly called daisy in North America; -- called also oxeye daisy. See\n   Whiteweed.'),
(19019, 'Daker', 'n.', 'Alt. of Dakir'),
(19020, 'Dakir', 'n.', 'A measure of certain commodities by number, usually ten or\n   twelve, but sometimes twenty; as, a daker of hides consisted of ten\n   skins; a daker of gloves of ten pairs.'),
(19021, 'Dakoit', 'n.', 'Alt. of Dakoity'),
(19022, 'Dakoity', 'n.', 'See Dacoit, Dacoity.'),
(19023, 'Dakotas', 'n. pl', 'An extensive race or stock of Indians, including many\n   tribes, mostly dwelling west of the Mississippi River; -- also, in\n   part, called Sioux.'),
(19024, 'Dalesmen', 'pl. ', 'of Dalesman'),
(19025, 'Dalesman', 'n.', 'One living in a dale; -- a term applied particularly to\n   the inhabitants of the valleys in the north of England, Norway, etc.'),
(19026, 'Dallier', 'n.', 'One who fondles; a trifler; as, dalliers with pleasant\n   words.'),
(19027, 'Dallop', 'n.', 'A tuft or clump.'),
(19028, 'Dallied', 'imp. & p. p.', 'of Dally'),
(19029, 'Dallying', 'p. pr. & vb. n.', 'of Dally'),
(19030, 'Dally', 'v. i.', 'To waste time in effeminate or voluptuous pleasures, or\n   in idleness; to fool away time; to delay unnecessarily; to tarry; to\n   trifle.'),
(19031, 'Dally', 'v. i.', 'To interchange caresses, especially with one of the\n   opposite sex; to use fondling; to wanton; to sport.'),
(19032, 'Dally', 'v. t.', 'To delay unnecessarily; to while away.'),
(19033, 'Dalmania', 'n.', 'A genus of trilobites, of many species, common in the\n   Upper Silurian and Devonian rocks.'),
(19034, 'Dalmatic', 'n.', 'A vestment with wide sleeves, and with two stripes, worn\n   at Mass by deacons, and by bishops at pontifical Mass; -- imitated from\n   a dress originally worn in Dalmatia.'),
(19035, 'Dalmatic', 'n.', 'A robe worn on state ocasions, as by English kings at\n   their coronation.'),
(19036, 'Dammed', 'imp. & p. p.', 'of Dam'),
(19037, 'Damming', 'p. pr. & vb. n.', 'of Dam'),
(19038, 'Damage', 'n.', 'Injury or harm to person, property, or reputation; an\n   inflicted loss of value; detriment; hurt; mischief.'),
(19039, 'Damage', 'n.', 'The estimated reparation in money for detriment or injury\n   sustained; a compensation, recompense, or satisfaction to one party,\n   for a wrong or injury actually done to him by another.'),
(19040, 'Damages', 'imp. & p. p.', 'of Damage'),
(19041, 'Damaging', 'p. pr. & vb. n.', 'of Damage'),
(19042, 'Damage', 'n.', 'To ocassion damage to the soudness, goodness, or value of;\n   to hurt; to injure; to impair.'),
(19043, 'Damage', 'v. i.', 'To receive damage or harm; to be injured or impaired in\n   soudness or value; as. some colors in /oth damage in sunlight.'),
(19044, 'Daman', 'n.', 'A small herbivorous mammal of the genus Hyrax. The species\n   found in Palestine and Syria is Hyrax Syriacus; that of Northern Africa\n   is H. Brucei; -- called also ashkoko, dassy, and rock rabbit. See Cony,\n   and Hyrax.'),
(19045, 'Damar', 'n.', 'See Dammar.'),
(19046, 'Damascus', 'n.', 'A city of Syria.'),
(19047, 'Damask', 'n.', 'Damask silk; silk woven with an elaborate pattern of\n   flowers and the like.'),
(19048, 'Damask', 'n.', 'Linen so woven that a pattern in produced by the different\n   directions of the thread, without contrast of color.'),
(19049, 'Damask', 'n.', 'A heavy woolen or worsted stuff with a pattern woven in the\n   same way as the linen damask; -- made for furniture covering and\n   hangings.'),
(19050, 'Damask', 'n.', 'Damask or Damascus steel; also, the peculiar markings or\n   \"water\" of such steel.'),
(19051, 'Damask', 'n.', 'A deep pink or rose color.'),
(19052, 'Damask', 'a.', 'Pertaining to, or originating at, the city of Damascus;\n   resembling the products or manufactures of Damascus.'),
(19053, 'Damask', 'a.', 'Having the color of the damask rose.'),
(19054, 'Damasked', 'imp. & p. p.', 'of Damask'),
(19055, 'Damask', 'v. t.', 'To decorate in a way peculiar to Damascus or attributed\n   to Damascus; particularly: (a) with flowers and rich designs, as silk;\n   (b) with inlaid lines of gold, etc., or with a peculiar marking or\n   \"water,\" as metal. See Damaskeen.'),
(19056, 'Damasken', 'v.', 'To decorate, as iron, steel, etc., with a peculiar\n   marking or \"water\" produced in the process of manufacture, or with\n   designs produced by inlaying or incrusting with another metal, as\n   silver or gold, or by etching, etc., to damask.'),
(19057, 'Damaskin', 'n.', 'A sword of Damask steel.'),
(19058, 'Damasse', 'a.', 'Woven like damask.'),
(19059, 'Damasse', 'n.', 'A damasse fabric, esp. one of linen.'),
(19060, 'Damassin', 'n.', 'A kind of modified damask or brocade.'),
(19061, 'Dambose', 'n.', 'A crystalline variety of fruit sugar obtained from\n   dambonite.'),
(19062, 'Damewort', 'n.', 'A cruciferrous plant (Hesperis matronalis), remarkable\n   for its fragrance, especially toward the close of the day; -- called\n   also rocket and dame\'s violet.'),
(19063, 'Damiana', 'n.', 'A Mexican drug, used as an aphrodisiac.'),
(19064, 'Dammar', 'n.', 'Alt. of Dammara'),
(19065, 'Dammara', 'n.', 'An oleoresin used in making varnishes; dammar gum; dammara\n   resin. It is obtained from certain resin trees indigenous to the East\n   Indies, esp. Shorea robusta and the dammar pine.'),
(19066, 'Dammara', 'n.', 'A large tree of the order Coniferae, indigenous to the\n   East Indies and Australasia; -- called also Agathis. There are several\n   species.'),
(19067, 'Damned', 'imp. & p. p.', 'of Damn'),
(19068, 'Damning', 'p. pr. & vb. n.', 'of Damn'),
(19069, 'Damnable', 'a.', 'Liable to damnation; deserving, or for which one\n   deserves, to be damned; of a damning nature.'),
(19070, 'Damnable', 'a.', 'Odious; pernicious; detestable.'),
(19071, 'Damnably', 'adv.', 'In a manner to incur severe censure, condemnation, or\n   punishment.'),
(19072, 'Damnably', 'adv.', 'Odiously; detestably; excessively.'),
(19073, 'Damned', 'a.', 'Sentenced to punishment in a future state; condemned;\n   consigned to perdition.'),
(19074, 'Damned', 'a.', 'Hateful; detestable; abominable.'),
(19075, 'Damnific', 'a.', 'Procuring or causing loss; mischievous; injurious.'),
(19076, 'Damnify', 'v. t.', 'To cause loss or damage to; to injure; to impair.'),
(19077, 'Damning', 'a.', 'That damns; damnable; as, damning evidence of guilt.'),
(19078, 'damnum', 'n.', 'Harm; detriment, either to character or property.'),
(19079, 'Damosel', 'n.', 'Alt. of Damoiselle'),
(19080, 'Damped', 'imp. & p. p.', 'of Damp'),
(19081, 'Damping', 'p. pr. & vb. n.', 'of Damp'),
(19082, 'Dampened', 'imp. & p. p.', 'of Dampen'),
(19083, 'Dampen', 'v. t.', 'To make damp or moist; to make slightly wet.'),
(19084, 'Dampen', 'v. t.', 'To depress; to check; to make dull; to lessen.'),
(19085, 'Dampen', 'v. i.', 'To become damp; to deaden.'),
(19086, 'Damper', 'n.', 'That which damps or checks; as: (a) A valve or movable\n   plate in the flue or other part of a stove, furnace, etc., used to\n   check or regulate the draught of air. (b) A contrivance, as in a\n   pianoforte, to deaden vibrations; or, as in other pieces of mechanism,\n   to check some action at a particular time.'),
(19087, 'Dampish', 'a.', 'Moderately damp or moist.'),
(19088, 'Dampne', 'v. t.', 'To damn.'),
(19089, 'Dampness', 'n.', 'Moderate humidity; moisture; fogginess; moistness.'),
(19090, 'Damp off', '', 'To decay and perish through excessive moisture.'),
(19091, 'Dampy', 'a.', 'Somewhat damp.'),
(19092, 'Dampy', 'a.', 'Dejected; gloomy; sorrowful.'),
(19093, 'Damsel', 'n.', 'A young person, either male or female, of noble or gentle\n   extraction; as, Damsel Pepin; Damsel Richard, Prince of Wales.'),
(19094, 'Damsel', 'n.', 'A young unmarried woman; a girl; a maiden.'),
(19095, 'Damsel', 'n.', 'An attachment to a millstone spindle for shaking the\n   hopper.'),
(19096, 'Damson', 'n.', 'A small oval plum of a blue color, the fruit of a variety\n   of the Prunus domestica; -- called also damask plum.'),
(19097, 'Danaide', 'n.', 'A water wheel having a vertical axis, and an inner and\n   outer tapering shell, between which are vanes or floats attached\n   usually to both shells, but sometimes only to one.'),
(19098, 'Danaite', 'n.', 'A cobaltiferous variety of arsenopyrite.'),
(19099, 'Danalite', 'n.', 'A mineral occuring in octahedral crystals, also massive,\n   of a reddish color. It is a silicate of iron, zinc manganese, and\n   glucinum, containing sulphur.'),
(19100, 'Danced', 'imp. & p. p.', 'of Dance'),
(19101, 'Dancing', 'p. pr. & vb. n.', 'of Dance'),
(19102, 'Dance', 'v. i.', 'To move with measured steps, or to a musical\n   accompaniment; to go through, either alone or in company with others,\n   with a regulated succession of movements, (commonly) to the sound of\n   music; to trip or leap rhythmically.'),
(19103, 'Dance', 'v. i.', 'To move nimbly or merrily; to express pleasure by motion;\n   to caper; to frisk; to skip about.'),
(19104, 'Dance', 'v. t.', 'To cause to dance, or move nimbly or merrily about, or up\n   and down; to dandle.'),
(19105, 'Dance', 'v. i.', 'The leaping, tripping, or measured stepping of one who\n   dances; an amusement, in which the movements of the persons are\n   regulated by art, in figures and in accord with music.'),
(19106, 'Dance', 'v. i.', 'A tune by which dancing is regulated, as the minuet, the\n   waltz, the cotillon, etc.'),
(19107, 'Dancer', 'n.', 'One who dances or who practices dancing.'),
(19108, 'Dancette', 'a.', 'Deeply indented; having large teeth; thus, a fess\n   dancette has only three teeth in the whole width of the escutcheon.'),
(19109, 'Dancing', 'p. a. & vb. n.', 'from Dance.'),
(19110, 'Dancy', 'a.', 'Same as Dancette.'),
(19111, 'Dander', 'n.', 'Dandruff or scurf on the head.'),
(19112, 'Dander', 'n.', 'Anger or vexation; rage.'),
(19113, 'Dander', 'v. i.', 'To wander about; to saunter; to talk incoherently.'),
(19114, 'Dandi', 'n.', 'A boatman; an oarsman.'),
(19115, 'Dandie', 'n.', 'One of a breed of small terriers; -- called also Dandie\n   Dinmont.'),
(19116, 'Dandify', 'v. t.', 'To cause to resemble a dandy; to make dandyish.'),
(19117, 'Dandled', 'imp. & p. p.', 'of Dandle'),
(19118, 'Dandling', 'p. pr. & vb. n.', 'of Dandle'),
(19119, 'Dandle', 'v. t.', 'To move up and down on one\'s knee or in one\'s arms, in\n   affectionate play, as an infant.'),
(19120, 'Dandle', 'v. t.', 'To treat with fondness, as if a child; to fondle; to toy\n   with; to pet.'),
(19121, 'Dandle', 'v. t.', 'To play with; to put off or delay by trifles; to\n   wheedle.'),
(19122, 'Dandler', 'n.', 'One who dandles or fondles.'),
(19123, 'Dandriff', 'n.', 'See Dandruff.'),
(19124, 'Dandruff', 'n.', 'A scurf which forms on the head, and comes off in small\n   or particles.'),
(19125, 'Dandies', 'pl. ', 'of Dandy'),
(19126, 'Dandy', 'n.', 'One who affects special finery or gives undue attention to\n   dress; a fop; a coxcomb.'),
(19127, 'Dandy', 'n.', 'A sloop or cutter with a jigger on which a lugsail is set.'),
(19128, 'Dandy', 'n.', 'A small sail carried at or near the stern of small boats; --\n   called also jigger, and mizzen.'),
(19129, 'Dandy', 'n.', 'A dandy roller. See below.'),
(19130, 'Dandyish', 'a.', 'Like a dandy.'),
(19131, 'Dandyism', 'n.', 'The manners and dress of a dandy; foppishness.'),
(19132, 'Dandyise', 'v. t. & i.', 'To make, or to act, like a dandy; to dandify.'),
(19133, 'Danegeld', 'n.', 'Alt. of Danegelt'),
(19134, 'Danegelt', 'n.', 'An annual tax formerly laid on the English nation to buy\n   off the ravages of Danish invaders, or to maintain forces to oppose\n   them. It afterward became a permanent tax, raised by an assessment, at\n   first of one shilling, afterward of two shillings, upon every hide of\n   land throughout the realm.'),
(19135, 'Danewort', 'n.', 'A fetid European species of elder (Sambucus Ebulus);\n   dwarf elder; wallwort; elderwort; -- called also Daneweed, Dane\'s weed,\n   and Dane\'s-blood. [Said to grow on spots where battles were fought\n   against the Danes.]'),
(19136, 'Danger', 'n.', 'Authority; jurisdiction; control.'),
(19137, 'Danger', 'n.', 'Power to harm; subjection or liability to penalty.'),
(19138, 'Danger', 'n.', 'Exposure to injury, loss, pain, or other evil; peril; risk;\n   insecurity.'),
(19139, 'Danger', 'n.', 'Difficulty; sparingness.'),
(19140, 'Danger', 'n.', 'Coyness; disdainful behavior.'),
(19141, 'Danger', 'v. t.', 'To endanger.'),
(19142, 'Dangled', 'imp. & p. p.', 'of Dangle'),
(19143, 'Dangling', 'p. pr. & vb. n.', 'of Dangle'),
(19144, 'Dangle', 'v. i.', 'To hang loosely, or with a swinging or jerking motion.'),
(19145, 'Dangle', 'v. t.', 'To cause to dangle; to swing, as something suspended\n   loosely; as, to dangle the feet.'),
(19146, 'Dangler', 'n.', 'One who dangles about or after others, especially after\n   women; a trifler.'),
(19147, 'Daniel', 'n.', 'A Hebrew prophet distinguished for sagacity and ripeness of\n   judgment in youth; hence, a sagacious and upright judge.'),
(19148, 'Danish', 'a.', 'Belonging to the Danes, or to their language or country.'),
(19149, 'Danish', 'n.', 'The language of the Danes.'),
(19150, 'Danite', 'n.', 'A descendant of Dan; an Israelite of the tribe of Dan.'),
(19151, 'Danite', 'n.', 'One of a secret association of Mormons, bound by an oath to\n   obey the heads of the church in all things.'),
(19152, 'Dankish', 'a.', 'Somewhat dank.'),
(19153, 'Danseuse', 'n.', 'A professional female dancer; a woman who dances at a\n   public exhibition as in a ballet.'),
(19154, 'Dansk', 'a.', 'Danish.'),
(19155, 'Dansker', 'n.', 'A Dane.'),
(19156, 'Dantean', 'a.', 'Relating to, emanating from or resembling, the poet Dante\n   or his writings.'),
(19157, 'Danubian', 'a.', 'Pertaining to, or bordering on, the river Danube.'),
(19158, 'Daphne', 'n.', 'A genus of diminutive Shrubs, mostly evergreen, and with\n   fragrant blossoms.'),
(19159, 'Daphne', 'n.', 'A nymph of Diana, fabled to have been changed into a laurel\n   tree.'),
(19160, 'Daphnia', 'n.', 'A genus of the genus Daphnia.'),
(19161, 'Daphnin', 'n.', 'A dark green bitter resin extracted from the mezereon\n   (Daphne mezereum) and regarded as the essential principle of the plant.'),
(19162, 'Daphnin', 'n.', 'A white, crystalline, bitter substance, regarded as a\n   glucoside, and extracted from Daphne mezereum and D. alpina.'),
(19163, 'Dapifer', 'n.', 'One who brings meat to the table; hence, in some\n   countries, the official title of the grand master or steward of the\n   king\'s or a nobleman\'s household.'),
(19164, 'Dapper', 'a.', 'Little and active; spruce; trim; smart; neat in dress or\n   appearance; lively.'),
(19165, 'Dapple', 'n.', 'One of the spots on a dappled animal.'),
(19166, 'Dapple', 'a.', 'Alt. of Dappled'),
(19167, 'Dappled', 'a.', 'Marked with spots of different shades of color; spotted;\n   variegated; as, a dapple horse.'),
(19168, 'Dappled', 'imp. & p. p.', 'of Dapple'),
(19169, 'Dappling', 'p. pr. & vb. n.', 'of Dapple'),
(19170, 'Dapple', 'v. t.', 'To variegate with spots; to spot.'),
(19171, 'Darbies', 'n. pl.', 'Manacles; handcuffs.'),
(19172, 'Darby', 'n.', 'A plasterer\'s float, having two handles; -- used in\n   smoothing ceilings, etc.'),
(19173, 'Darbyite', 'n.', 'One of the Plymouth Brethren, or of a sect among them; --\n   so called from John N. Darby, one of the leaders of the Brethren.'),
(19174, 'Durst', 'imp.', 'of Dare'),
(19175, 'Dared', '', 'of Dare'),
(19176, 'Dared', 'p. p.', 'of Dare'),
(19177, 'Daring', 'p. pr. & vb. n.', 'of Dare'),
(19178, 'Dared', 'imp. & p. p.', 'of Dare'),
(19179, 'Daring', 'p. pr. & vb. n.', 'of Dare'),
(19180, 'Dareful', 'a.', 'Full of daring or of defiance; adventurous.'),
(19181, 'Darer', 'n.', 'One who dares or defies.'),
(19182, 'Dargue', 'n.', 'A day\'s work; also, a fixed amount of work, whether more or\n   less than that of a day.'),
(19183, 'Daric', 'n.', 'A gold coin of ancient Persia, weighing usually a little\n   more than 128 grains, and bearing on one side the figure of an archer.'),
(19184, 'Daric', 'n.', 'A silver coin of about 86 grains, having the figure of an\n   archer, and hence, in modern times, called a daric.'),
(19185, 'Daric', 'n.', 'Any very pure gold coin.'),
(19186, 'Daring', 'n.', 'Boldness; fearlessness; adventurousness; also, a daring\n   act.'),
(19187, 'Daring', 'a.', 'Bold; fearless; adventurous; as, daring spirits.'),
(19188, 'Darkened', 'imp. & p. p.', 'of Darken'),
(19189, 'Darken', 'a.', 'To make dark or black; to deprive of light; to obscure; as,\n   a darkened room.'),
(19190, 'Darken', 'a.', 'To render dim; to deprive of vision.'),
(19191, 'Darken', 'a.', 'To cloud, obscure, or perplex; to render less clear or\n   intelligible.'),
(19192, 'Darken', 'a.', 'To cast a gloom upon.'),
(19193, 'Darken', 'a.', 'To make foul; to sully; to tarnish.'),
(19194, 'Darken', 'v. i.', 'To grow or darker.'),
(19195, 'Darkener', 'n.', 'One who, or that which, darkens.'),
(19196, 'Darkful', 'a.', 'Full of darkness.'),
(19197, 'Darkish', 'a.', 'Somewhat dark; dusky.'),
(19198, 'Darkle', 'v. i.', 'To grow dark; to show indistinctly.'),
(19199, 'Darkling', 'adv.', 'In the dark.'),
(19200, 'Darkling', 'p. pr. & a.', 'Becoming dark or gloomy; frowing.'),
(19201, 'Darkling', 'p. pr. & a.', 'Dark; gloomy.'),
(19202, 'Darkly', 'adv.', 'With imperfect light, clearness, or knowledge; obscurely;\n   dimly; blindly; uncertainly.'),
(19203, 'Darkly', 'adv.', 'With a dark, gloomy, cruel, or menacing look.'),
(19204, 'Darkness', 'n.', 'The absence of light; blackness; obscurity; gloom.'),
(19205, 'Darkness', 'n.', 'A state of privacy; secrecy.'),
(19206, 'Darkness', 'n.', 'A state of ignorance or error, especially on moral or\n   religious subjects; hence, wickedness; impurity.'),
(19207, 'Darkness', 'n.', 'Want of clearness or perspicuity; obscurity; as, the\n   darkness of a subject, or of a discussion.'),
(19208, 'Darkness', 'n.', 'A state of distress or trouble.'),
(19209, 'Darksome', 'a.', 'Dark; gloomy; obscure; shaded; cheerless.'),
(19210, 'Darky', 'n.', 'A negro.'),
(19211, 'Darling', 'n.', 'One dearly beloved; a favorite.'),
(19212, 'Darling', 'a.', 'Dearly beloved; regarded with especial kindness and\n   tenderness; favorite.'),
(19213, 'Darned', 'imp. & p. p.', 'of Darn'),
(19214, 'Darning', 'p. pr. & vb. n.', 'of Darn'),
(19215, 'Darnel', 'n.', 'Any grass of the genus Lolium, esp. the Lolium temulentum\n   (bearded darnel), the grains of which have been reputed poisonous.\n   Other species, as Lolium perenne (rye grass or ray grass), and its\n   variety L. Italicum (Italian rye grass), are highly esteemed for\n   pasture and for making hay.'),
(19216, 'Darner', 'n.', 'One who mends by darning.'),
(19217, 'Darnex', 'n.', 'Alt. of Darnic'),
(19218, 'Darnic', 'n.', 'Same as Dornick.'),
(19219, 'Daroo', 'n.', 'The Egyptian sycamore (Ficus Sycamorus). See Sycamore.'),
(19220, 'Darraign', 'v. t.', 'Alt. of Darrain'),
(19221, 'Darrain', 'v. t.', 'To make ready to fight; to array.'),
(19222, 'Darrain', 'v. t.', 'To fight out; to contest; to decide by combat.'),
(19223, 'Darrein', 'a.', 'Last; as, darrein continuance, the last continuance.'),
(19224, 'Darted', 'imp. & p. p.', 'of Dart'),
(19225, 'Darting', 'p. pr. & vb. n.', 'of Dart'),
(19226, 'Dartars', 'n.', 'A kind of scab or ulceration on the skin of lambs.'),
(19227, 'Darter', 'n.', 'One who darts, or who throw darts; that which darts.'),
(19228, 'Darter', 'n.', 'The snakebird, a water bird of the genus Plotus; -- so\n   called because it darts out its long, snakelike neck at its prey. See\n   Snakebird.'),
(19229, 'Darter', 'n.', 'A small fresh-water etheostomoid fish. The group includes\n   numerous genera and species, all of them American. See Etheostomoid.'),
(19230, 'Dartle', 'v. t. & i.', 'To pierce or shoot through; to dart repeatedly: --\n   frequentative of dart.'),
(19231, 'Dartoic', 'a.', 'Of or pertaining to the dartos.'),
(19232, 'Dartoid', 'a.', 'Like the dartos; dartoic; as, dartoid tissue.'),
(19233, 'Dartos', 'n.', 'A thin layer of peculiar contractile tissue directly\n   beneath the skin of the scrotum.'),
(19234, 'Dartrous', 'a.', 'Relating to, or partaking of the nature of, the disease\n   called tetter; herpetic.'),
(19235, 'Dasewe', 'v. i.', 'To become dim-sighted; to become dazed or dazzled.'),
(19236, 'Dashed', 'imp. & p. p.', 'of Dash'),
(19237, 'Dashing', 'p. pr. & vb. n.', 'of Dash'),
(19238, 'Dasher', 'n.', 'That which dashes or agitates; as, the dasher of a churn.'),
(19239, 'Dasher', 'n.', 'A dashboard or splashboard.'),
(19240, 'Dasher', 'n.', 'One who makes an ostentatious parade.'),
(19241, 'Dashing', 'a.', 'Bold; spirited; showy.'),
(19242, 'Dashism', 'n.', 'The character of making ostentatious or blustering parade\n   or show.'),
(19243, 'Dashpot', 'n.', 'A pneumatic or hydraulic cushion for a falling weight, as\n   in the valve gear of a steam engine, to prevent shock.'),
(19244, 'Dashy', 'a.', 'Calculated to arrest attention; ostentatiously fashionable;\n   showy.'),
(19245, 'Dastard', 'n.', 'One who meanly shrinks from danger; an arrant coward; a\n   poltroon.'),
(19246, 'Dastard', 'a.', 'Meanly shrinking from danger; cowardly; dastardly.'),
(19247, 'Dastard', 'v. t.', 'To dastardize.'),
(19248, 'Dastardy', 'n.', 'Base timidity; cowardliness.'),
(19249, 'Daswe', 'v. i.', 'See Dasewe'),
(19250, 'Dasyure', 'n.', 'A carnivorous marsupial quadruped of Australia, belonging\n   to the genus Dasyurus. There are several species.'),
(19251, 'Datable', 'a.', 'That may be dated; having a known or ascertainable date.'),
(19252, 'Dataria', 'n.', 'Formerly, a part of the Roman chancery; now, a separate\n   office from which are sent graces or favors, cognizable in foro\n   externo, such as appointments to benefices. The name is derived from\n   the word datum, given or dated (with the indications of the time and\n   place of granting the gift or favor).'),
(19253, 'Datary', 'n.', 'An officer in the pope\'s court, having charge of the\n   Dataria.'),
(19254, 'Datary', 'n.', 'The office or employment of a datary.'),
(19255, 'Dated', 'imp. & p. p.', 'of Date'),
(19256, 'Dating', 'p. pr. & vb. n.', 'of Date'),
(19257, 'Dateless', 'a.', 'Without date; having no fixed time.'),
(19258, 'Dater', 'n.', 'One who dates.'),
(19259, 'Datiscin', 'n.', 'A white crystalline glucoside extracted from the bastard\n   hemp (Datisca cannabina).'),
(19260, 'Dative', 'a.', 'Noting the case of a noun which expresses the remoter\n   object, and is generally indicated in English by to or for with the\n   objective.'),
(19261, 'Dative', 'a.', 'In one\'s gift; capable of being disposed of at will and\n   pleasure, as an office.'),
(19262, 'Dative', 'a.', 'Removable, as distinguished from perpetual; -- said of an\n   officer.'),
(19263, 'Dative', 'a.', 'Given by a magistrate, as distinguished from being cast\n   upon a party by the law.'),
(19264, 'Dative', 'n.', 'The dative case. See Dative, a., 1.'),
(19265, 'Datively', 'adv.', 'As a gift.'),
(19266, 'Datolite', 'n.', 'A borosilicate of lime commonly occuring in glassy,,\n   greenish crystals.'),
(19267, 'Datum', 'n.', 'Something given or admitted; a fact or principle granted;\n   that upon which an inference or an argument is based; -- used chiefly\n   in the plural.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(19268, 'Datum', 'n.', 'The quantities or relations which are assumed to be given in\n   any problem.'),
(19269, 'Datura', 'n.', 'A genus of solanaceous plants, with large funnel-shaped\n   flowers and a four-celled, capsular fruit.'),
(19270, 'Daturine', 'n.', 'Atropine; -- called also daturia and daturina.'),
(19271, 'Daubed', 'imp. & p. p.', 'of Daub'),
(19272, 'Daubing', 'p. pr. & vb. n.', 'of Daub'),
(19273, 'Dauber', 'n.', 'One who, or that which, daubs; especially, a coarse,\n   unskillful painter.'),
(19274, 'Dauber', 'n.', 'A pad or ball of rags, covered over with canvas, for inking\n   plates; a dabber.'),
(19275, 'Dauber', 'n.', 'A low and gross flatterer.'),
(19276, 'Dauber', 'n.', 'The mud wasp; the mud dauber.'),
(19277, 'Daubery', 'n.', 'Alt. of Daubry'),
(19278, 'Daubry', 'n.', 'A daubing; specious coloring; false pretenses.'),
(19279, 'Daubing', 'n.', 'The act of one who daubs; that which is daubed.'),
(19280, 'Daubing', 'n.', 'A rough coat of mortar put upon a wall to give it the\n   appearance of stone; rough-cast.'),
(19281, 'Daubing', 'n.', 'In currying, a mixture of fish oil and tallow worked into\n   leather; -- called also dubbing.'),
(19282, 'Dauby', 'a.', 'Smeary; viscous; glutinous; adhesive.'),
(19283, 'Daughter', 'n.', 'The female offspring of the human species; a female child\n   of any age; -- applied also to the lower animals.'),
(19284, 'Daughter', 'n.', 'A female descendant; a woman.'),
(19285, 'Daughter', 'n.', 'A son\'s wife; a daughter-in-law.'),
(19286, 'Daughter', 'n.', 'A term of address indicating parental interest.'),
(19287, 'Daunted', 'imp. & p. p.', 'of Daunt'),
(19288, 'Daunting', 'p. pr. & vb. n.', 'of Daunt'),
(19289, 'Daunt', 'v. t.', 'To overcome; to conquer.'),
(19290, 'Daunt', 'v. t.', 'To repress or subdue the courage of; to check by fear of\n   danger; to cow; to intimidate; to dishearten.'),
(19291, 'Daunter', 'n.', 'One who daunts.'),
(19292, 'Dauphin', 'n.', 'The title of the eldest son of the king of France, and\n   heir to the crown. Since the revolution of 1830, the title has been\n   discontinued.'),
(19293, 'Dauphine', 'n.', 'The title of the wife of the dauphin.'),
(19294, 'Davidic', 'a.', 'Of or pertaining to David, the king and psalmist of\n   Israel, or to his family.'),
(19295, 'Davit', 'n.', 'A spar formerly used on board of ships, as a crane to hoist\n   the flukes of the anchor to the top of the bow, without injuring the\n   sides of the ship; -- called also the fish davit.'),
(19296, 'Davit', 'n.', 'Curved arms of timber or iron, projecting over a ship\'s side\n   of stern, having tackle to raise or lower a boat, swing it in on deck,\n   rig it out for lowering, etc.; -- called also boat davits.'),
(19297, 'Davyne', 'n.', 'A variety of nephelite from Vesuvius.'),
(19298, 'Davyum', 'n.', 'A rare metallic element found in platinum ore. It is a\n   white malleable substance. Symbol Da. Atomic weight 154.'),
(19299, 'Dawdled', 'imp. & p. p.', 'of Dawdle'),
(19300, 'Dawdling', 'p. pr. & vb. n.', 'of Dawdle'),
(19301, 'Dawdle', 'v. i.', 'To waste time in trifling employment; to trifle; to\n   saunter.'),
(19302, 'Dawdle', 'v. t.', 'To waste by trifling; as, to dawdle away a whole\n   morning.'),
(19303, 'Dawdle', 'n.', 'A dawdler.'),
(19304, 'Dawdler', 'n.', 'One who wastes time in trifling employments; an idler; a\n   trifler.'),
(19305, 'Dawish', 'a.', 'Like a daw.'),
(19306, 'Dawned', 'imp. & p. p.', 'of Dawn'),
(19307, 'Dawning', 'p. pr. & vb. n.', 'of Dawn'),
(19308, 'Dayaks', 'n. pl.', 'See Dyaks.'),
(19309, 'Daybook', 'n.', 'A journal of accounts; a primary record book in which are\n   recorded the debts and credits, or accounts of the day, in their order,\n   and from which they are transferred to the journal.'),
(19310, 'Daybreak', 'n.', 'The time of the first appearance of light in the morning.'),
(19311, 'Day-coal', 'n.', 'The upper stratum of coal, as nearest the light or\n   surface.'),
(19312, 'Daydream', 'n.', 'A vain fancy speculation; a reverie; a castle in the air;\n   unfounded hope.'),
(19313, 'Dayfly', 'n.', 'A neuropterous insect of the genus Ephemera and related\n   genera, of many species, and inhabiting fresh water in the larval\n   state; the ephemeral fly; -- so called because it commonly lives but\n   one day in the winged or adult state. See Ephemeral fly, under\n   Ephemeral.'),
(19314, 'Daylight', 'n.', 'The light of day as opposed to the darkness of night; the\n   light of the sun, as opposed to that of the moon or to artificial\n   light.'),
(19315, 'Daylight', 'n.', 'The eyes.'),
(19316, 'Day lily', '', 'A genus of plants (Hemerocallis) closely resembling true\n   lilies, but having tuberous rootstocks instead of bulbs. The common\n   species have long narrow leaves and either yellow or tawny-orange\n   flowers.'),
(19317, 'Day lily', '', 'A genus of plants (Funkia) differing from the last in\n   having ovate veiny leaves, and large white or blue flowers.'),
(19318, 'Daymaid', 'n.', 'A dairymaid.'),
(19319, 'Daymare', 'n.', 'A kind of incubus which occurs during wakefulness,\n   attended by the peculiar pressure on the chest which characterizes\n   nightmare.'),
(19320, 'Day-net', 'n.', 'A net for catching small birds.'),
(19321, 'Day-peep', 'n.', 'The dawn.'),
(19322, 'Daysman', 'n.', 'An umpire or arbiter; a mediator.'),
(19323, 'Day-star', 'n.', 'The morning star; the star which ushers in the day.'),
(19324, 'Day-star', 'n.', 'The sun, as the orb of day.'),
(19325, 'Daytime', 'n.', 'The time during which there is daylight, as distinguished\n   from the night.'),
(19326, 'Daywoman', 'n.', 'A dairymaid.'),
(19327, 'Dazed', 'imp. & p. p.', 'of Daze'),
(19328, 'Dazing', 'p. pr. & vb. n.', 'of Daze'),
(19329, 'Dazzled', 'imp. & p. p.', 'of Dazzle'),
(19330, 'Dazzling', 'p. pr. & vb. n.', 'of Dazzle'),
(19331, 'Dazzle', 'v. t.', 'To overpower with light; to confuse the sight of by\n   brilliance of light.'),
(19332, 'Dazzle', 'v. t.', 'To bewilder or surprise with brilliancy or display of\n   any kind.'),
(19333, 'Dazzle', 'v. i.', 'To be overpoweringly or intensely bright; to excite\n   admiration by brilliancy.'),
(19334, 'Dazzle', 'v. i.', 'To be overpowered by light; to be confused by excess of\n   brightness.'),
(19335, 'Dazzle', 'n.', 'A light of dazzling brilliancy.'),
(19336, 'Deacon', 'n.', 'An officer in Christian churches appointed to perform\n   certain subordinate duties varying in different communions. In the\n   Roman Catholic and Episcopal churches, a person admitted to the lowest\n   order in the ministry, subordinate to the bishops and priests. In\n   Presbyterian churches, he is subordinate to the minister and elders,\n   and has charge of certain duties connected with the communion service\n   and the care of the poor. In Congregational churches, he is subordinate\n   to the pastor, and has duties as in the Presbyterian church.'),
(19337, 'Deacon', 'n.', 'The chairman of an incorporated company.'),
(19338, 'Deacon', 'v. t.', 'To read aloud each line of (a psalm or hymn) before\n   singing it, -- usually with off.'),
(19339, 'Deaconry', 'n.', 'See Deaconship.'),
(19340, 'Deadbeat', 'a.', 'Making a beat without recoil; giving indications by a\n   single beat or excursion; -- said of galvanometers and other\n   instruments in which the needle or index moves to the extent of its\n   deflection and stops with little or no further oscillation.'),
(19341, 'Deadborn', 'a.', 'Stillborn.'),
(19342, 'Deadened', 'imp. & p. p.', 'of Deaden'),
(19343, 'Deaden', 'a.', 'To make as dead; to impair in vigor, force, activity, or\n   sensation; to lessen the force or acuteness of; to blunt; as, to deaden\n   the natural powers or feelings; to deaden a sound.'),
(19344, 'Deaden', 'a.', 'To lessen the velocity or momentum of; to retard; as, to\n   deaden a ship\'s headway.'),
(19345, 'Deaden', 'a.', 'To make vapid or spiritless; as, to deaden wine.'),
(19346, 'Deaden', 'a.', 'To deprive of gloss or brilliancy; to obscure; as, to\n   deaden gilding by a coat of size.'),
(19347, 'Deadener', 'n.', 'One who, or that which, deadens or checks.'),
(19348, 'Dead-eye', 'n.', 'A round, flattish, wooden block, encircled by a rope, or\n   an iron band, and pierced with three holes to receive the lanyard; --\n   used to extend the shrouds and stays, and for other purposes. Called\n   also deadman\'s eye.'),
(19349, 'Deadhead', 'n.', 'One who receives free tickets for theaters, public\n   conveyances, etc.'),
(19350, 'Deadhead', 'n.', 'A buoy. See under Dead, a.'),
(19351, 'Deadish', 'a.', 'Somewhat dead, dull, or lifeless; deathlike.'),
(19352, 'Deadlock', 'n.', 'A lock which is not self-latching, but requires a key to\n   throw the bolt forward.'),
(19353, 'Deadlock', 'n.', 'A counteraction of things, which produces an entire\n   stoppage; a complete obstruction of action.'),
(19354, 'Deadly', 'a.', 'Capable of causing death; mortal; fatal; destructive;\n   certain or likely to cause death; as, a deadly blow or wound.'),
(19355, 'Deadly', 'a.', 'Aiming or willing to destroy; implacable; desperately\n   hostile; flagitious; as, deadly enemies.'),
(19356, 'Deadly', 'a.', 'Subject to death; mortal.'),
(19357, 'Deadly', 'adv.', 'In a manner resembling, or as if produced by, death.'),
(19358, 'Deadly', 'adv.', 'In a manner to occasion death; mortally.'),
(19359, 'Deadly', 'adv.', 'In an implacable manner; destructively.'),
(19360, 'Deadly', 'adv.', 'Extremely.'),
(19361, 'Deadness', 'n.', 'The state of being destitute of life, vigor, spirit,\n   activity, etc.; dullness; inertness; languor; coldness; vapidness;\n   indifference; as, the deadness of a limb, a body, or a tree; the\n   deadness of an eye; deadness of the affections; the deadness of beer or\n   cider; deadness to the world, and the like.'),
(19362, 'Dead-pay', 'n.', 'Pay drawn for soldiers, or others, really dead, whose\n   names are kept on the rolls.'),
(19363, 'Deads', 'n. pl.', 'The substances which inclose the ore on every side.'),
(19364, 'Deadwood', 'n.', 'A mass of timbers built into the bow and stern of a\n   vessel to give solidity.'),
(19365, 'Deadwood', 'n.', 'Dead trees or branches; useless material.'),
(19366, 'Deafened', 'imp. & p. p.', 'of Deafen'),
(19367, 'Deafen', 'v. t.', 'To make deaf; to deprive of the power of hearing; to\n   render incapable of perceiving sounds distinctly.'),
(19368, 'Deafen', 'v. t.', 'To render impervious to sound, as a partition or floor,\n   by filling the space within with mortar, by lining with paper, etc.'),
(19369, 'Deafly', 'adv.', 'Without sense of sounds; obscurely.'),
(19370, 'Deafly', 'a.', 'Lonely; solitary.'),
(19371, 'Deafness', 'n.', 'Incapacity of perceiving sounds; the state of the organs\n   which prevents the impression which constitute hearing; want of the\n   sense of hearing.'),
(19372, 'Deafness', 'n.', 'Unwillingness to hear; voluntary rejection of what is\n   addressed to the understanding.'),
(19373, 'Dealt', 'imp. & p. p.', 'of Deal'),
(19374, 'Dealing', 'p. pr. & vb. n.', 'of Deal'),
(19375, 'Dealbate', 'v. t.', 'To whiten.'),
(19376, 'Dealer', 'n.', 'One who deals; one who has to do, or has concern, with\n   others; esp., a trader, a trafficker, a shopkeeper, a broker, or a\n   merchant; as, a dealer in dry goods; a dealer in stocks; a retail\n   dealer.'),
(19377, 'Dealer', 'n.', 'One who distributes cards to the players.'),
(19378, 'Dealfish', 'n.', 'A long, thin fish of the arctic seas (Trachypterus\n   arcticus).'),
(19379, 'Dealing', 'n.', 'The act of one who deals; distribution of anything, as of\n   cards to the players; method of business; traffic; intercourse;\n   transaction; as, to have dealings with a person.'),
(19380, 'Dealth', 'n.', 'Share dealt.'),
(19381, 'Deanery', 'n.', 'The office or the revenue of a dean. See the Note under\n   Benefice, n., 3.'),
(19382, 'Deanery', 'n.', 'The residence of a dean.'),
(19383, 'Deanery', 'n.', 'The territorial jurisdiction of a dean.'),
(19384, 'Deanship', 'n.', 'The office of a dean.'),
(19385, 'Dearborn', 'n.', 'A four-wheeled carriage, with curtained sides.'),
(19386, 'Deare', '', 'variant of Dere, v. t. & n.'),
(19387, 'Dearie', 'n.', 'Same as Deary.'),
(19388, 'Dearling', 'n.', 'A darling.'),
(19389, 'Dearly', 'adv.', 'In a dear manner; with affection; heartily; earnestly;\n   as, to love one dearly.'),
(19390, 'Dearly', 'adv.', 'At a high rate or price; grievously.'),
(19391, 'Dearly', 'adv.', 'Exquisitely.'),
(19392, 'Dearn', 'a.', 'Secret; lonely; solitary; dreadful.'),
(19393, 'Dearn', 'v. t.', 'Same as Darn.'),
(19394, 'Dearness', 'n.', 'The quality or state of being dear; costliness; excess of\n   price.'),
(19395, 'Dearness', 'n.', 'Fondness; preciousness; love; tenderness.'),
(19396, 'Dearth', 'n.', 'Scarcity which renders dear; want; lack; specifically, lack\n   of food on account of failure of crops; famine.'),
(19397, 'Deary', 'n.', 'A dear; a darling.'),
(19398, 'Death', 'v. i.', 'The cessation of all vital phenomena without capability\n   of resuscitation, either in animals or plants.'),
(19399, 'Death', 'v. i.', 'Total privation or loss; extinction; cessation; as, the\n   death of memory.'),
(19400, 'Death', 'v. i.', 'Manner of dying; act or state of passing from life.'),
(19401, 'Death', 'v. i.', 'Cause of loss of life.'),
(19402, 'Death', 'v. i.', 'Personified: The destroyer of life, -- conventionally\n   represented as a skeleton with a scythe.'),
(19403, 'Death', 'v. i.', 'Danger of death.'),
(19404, 'Death', 'v. i.', 'Murder; murderous character.'),
(19405, 'Death', 'v. i.', 'Loss of spiritual life.'),
(19406, 'Death', 'v. i.', 'Anything so dreadful as to be like death.'),
(19407, 'Deathbed', 'n.', 'The bed in which a person dies; hence, the closing hours\n   of life of one who dies by sickness or the like; the last sickness.'),
(19408, 'Deathful', 'a.', 'Full of death or slaughter; murderous; destructive;\n   bloody.'),
(19409, 'Deathful', 'a.', 'Liable to undergo death; mortal.'),
(19410, 'Deathly', 'a.', 'Deadly; fatal; mortal; destructive.'),
(19411, 'Deathly', 'adv.', 'Deadly; as, deathly pale or sick.'),
(19412, 'Deaurate', 'a.', 'Gilded.'),
(19413, 'Deaurate', 'v. t.', 'To gild.'),
(19414, 'Deave', 'v. t.', 'To stun or stupefy with noise; to deafen.'),
(19415, 'Debacle', 'n.', 'A breaking or bursting forth; a violent rush or flood of\n   waters which breaks down opposing barriers, and hurls forward and\n   disperses blocks of stone and other debris.'),
(19416, 'Debarred', 'imp. & p. p.', 'of Debar'),
(19417, 'Debar', 'v. t.', 'To cut off from entrance, as if by a bar or barrier; to\n   preclude; to hinder from approach, entry, or enjoyment; to shut out or\n   exclude; to deny or refuse; -- with from, and sometimes with of.'),
(19418, 'Debarb', 'v. t.', 'To deprive of the beard.'),
(19419, 'Debarked', 'imp. & p. p.', 'of Debark'),
(19420, 'Debark', 'v. t. & i.', 'To go ashore from a ship or boat; to disembark; to\n   put ashore.'),
(19421, 'Debased', 'imp. & p. p.', 'of Debase'),
(19422, 'Debasing', 'p. pr. & vb. n.', 'of Debase'),
(19423, 'Debase', 'a.', 'To reduce from a higher to a lower state or grade of worth,\n   dignity, purity, station, etc.; to degrade; to lower; to deteriorate;\n   to abase; as, to debase the character by crime; to debase the mind by\n   frivolity; to debase style by vulgar words.'),
(19424, 'Debased', 'a.', 'Turned upside down from its proper position; inverted;\n   reversed.'),
(19425, 'Debaser', 'n.', 'One who, or that which, debases.'),
(19426, 'Debated', 'imp. & p. p.', 'of Debate'),
(19427, 'Debating', 'p. pr. & vb. n.', 'of Debate'),
(19428, 'Debate', 'v. t.', 'To engage in combat for; to strive for.'),
(19429, 'Debate', 'v. t.', 'To contend for in words or arguments; to strive to\n   maintain by reasoning; to dispute; to contest; to discuss; to argue for\n   and against.'),
(19430, 'Debate', 'v. i.', 'To engage in strife or combat; to fight.'),
(19431, 'Debate', 'v. i.', 'To contend in words; to dispute; hence, to deliberate;\n   to consider; to discuss or examine different arguments in the mind; --\n   often followed by on or upon.'),
(19432, 'Debate', 'v. t.', 'A fight or fighting; contest; strife.'),
(19433, 'Debate', 'v. t.', 'Contention in words or arguments; discussion for the\n   purpose of elucidating truth or influencing action; strife in argument;\n   controversy; as, the debates in Parliament or in Congress.'),
(19434, 'Debate', 'v. t.', 'Subject of discussion.'),
(19435, 'Debater', 'n.', 'One who debates; one given to argument; a disputant; a\n   controvertist.'),
(19436, 'Debating', 'n.', 'The act of discussing or arguing; discussion.'),
(19437, 'Debauch', 'n.', 'To lead away from purity or excellence; to corrupt in\n   character or principles; to mar; to vitiate; to pollute; to seduce; as,\n   to debauch one\'s self by intemperance; to debauch a woman; to debauch\n   an army.'),
(19438, 'Debauch', 'n.', 'Excess in eating or drinking; intemperance; drunkenness;\n   lewdness; debauchery.'),
(19439, 'Debauch', 'n.', 'An act or occasion of debauchery.'),
(19440, 'Debeige', 'n.', 'A kind of woolen or mixed dress goods.'),
(19441, 'Debel', 'v. t.', 'To conquer.'),
(19442, 'Debile', 'a.', 'Weak.'),
(19443, 'Debility', 'a.', 'The state of being weak; weakness; feebleness; languor.'),
(19444, 'Debit', 'n.', 'A debt; an entry on the debtor (Dr.) side of an account; --\n   mostly used adjectively; as, the debit side of an account.'),
(19445, 'Debited', 'imp. & p. p.', 'of Debit'),
(19446, 'Debiting', 'p. pr. & vb. n.', 'of Debit'),
(19447, 'Debit', 'v. t.', 'To charge with debt; -- the opposite of, and correlative\n   to, credit; as, to debit a purchaser for the goods sold.'),
(19448, 'Debit', 'v. t.', 'To enter on the debtor (Dr.) side of an account; as, to\n   debit the amount of goods sold.'),
(19449, 'Debitor', 'n.', 'A debtor.'),
(19450, 'Deblai', 'n.', 'The cavity from which the earth for parapets, etc.\n   (remblai), is taken.'),
(19451, 'Debonair', 'a.', 'Characterized by courteousness, affability, or\n   gentleness; of good appearance and manners; graceful; complaisant.'),
(19452, 'Debosh', 'v. t.', 'To debauch.'),
(19453, 'Debouch', 'v. i.', 'To march out from a wood, defile, or other confined\n   spot, into open ground; to issue.'),
(19454, 'Debouche', 'n.', 'A place for exit; an outlet; hence, a market for goods.'),
(19455, 'Debris', 'n.', 'Broken and detached fragments, taken collectively;\n   especially, fragments detached from a rock or mountain, and piled up at\n   the base.'),
(19456, 'Debris', 'n.', 'Rubbish, especially such as results from the destruction of\n   anything; remains; ruins.'),
(19457, 'Debted', 'p. a.', 'Indebted; obliged to.'),
(19458, 'Debtee', 'n.', 'One to whom a debt is due; creditor; -- correlative to\n   debtor.'),
(19459, 'Debtless', 'a.', 'Free from debt.'),
(19460, 'Debtor', 'n.', 'One who owes a debt; one who is indebted; -- correlative to\n   creditor.'),
(19461, 'Deburse', 'v. t. & i.', 'To disburse.'),
(19462, 'Debut', 'n.', 'A beginning or first attempt; hence, a first appearance\n   before the public, as of an actor or public speaker.'),
(19463, 'Debutant', '', 'Alt. of Debutante'),
(19464, 'Deca-', '', 'A prefix, from Gr. de`ka, signifying ten; specifically (Metric\n   System), a prefix signifying the weight or measure that is ten times\n   the principal unit.'),
(19465, 'Decad', 'n.', 'A decade.'),
(19466, 'Decadal', 'a.', 'Pertaining to ten; consisting of tens.'),
(19467, 'Decade', 'n.', 'A group or division of ten; esp., a period of ten years; a\n   decennium; as, a decade of years or days; a decade of soldiers; the\n   second decade of Livy.'),
(19468, 'Decadent', 'a.', 'Decaying; deteriorating.'),
(19469, 'Decadist', 'n.', 'A writer of a book divided into decades; as, Livy was a\n   decadist.'),
(19470, 'Decagon', 'n.', 'A plane figure having ten sides and ten angles; any figure\n   having ten angles. A regular decagon is one that has all its sides and\n   angles equal.'),
(19471, 'Decagram', 'n.', 'Alt. of Decagramme'),
(19472, 'Decalog', 'n.', 'Decalogue.'),
(19473, 'Decamped', 'imp. & p. p.', 'of Decamp'),
(19474, 'Decamp', 'v. i.', 'To break up a camp; to move away from a camping ground,\n   usually by night or secretly.'),
(19475, 'Decamp', 'v. i.', 'Hence, to depart suddenly; to run away; -- generally\n   used disparagingly.'),
(19476, 'Decanal', 'a.', 'Pertaining to a dean or deanery.'),
(19477, 'Decane', 'n.', 'A liquid hydrocarbon, C10H22, of the paraffin series,\n   including several isomeric modifications.'),
(19478, 'Decani', 'a.', 'Used of the side of the choir on which the dean\'s stall is\n   placed; decanal; -- correlative to cantoris; as, the decanal, or\n   decani, side.'),
(19479, 'Decanted', 'imp. & p. p.', 'of Decant'),
(19480, 'Decant', 'v. t.', 'To pour off gently, as liquor, so as not to disturb the\n   sediment; or to pour from one vessel into another; as, to decant wine.'),
(19481, 'Decanter', 'n.', 'A vessel used to decant liquors, or for receiving\n   decanted liquors; a kind of glass bottle used for holding wine or other\n   liquors, from which drinking glasses are filled.'),
(19482, 'Decanter', 'n.', 'One who decants liquors.'),
(19483, 'Decapod', 'n.', 'A crustacean with ten feet or legs, as a crab; one of the\n   Decapoda. Also used adjectively.'),
(19484, 'Decapoda', 'n. pl.', 'The order of Crustacea which includes the shrimps,\n   lobsters, crabs, etc.'),
(19485, 'Decapoda', 'n. pl.', 'A division of the dibranchiate cephalopods including\n   the cuttlefishes and squids. See Decacera.'),
(19486, 'Decard', 'v. t.', 'To discard.'),
(19487, 'Decatoic', 'a.', 'Pertaining to, or derived from, decane.'),
(19488, 'Decayed', 'imp. & p. p.', 'of Decay'),
(19489, 'Decaying', 'p. pr. & vb. n.', 'of Decay'),
(19490, 'Decay', 'v. i.', 'To pass gradually from a sound, prosperous, or perfect\n   state, to one of imperfection, adversity, or dissolution; to waste\n   away; to decline; to fail; to become weak, corrupt, or disintegrated;\n   to rot; to perish; as, a tree decays; fortunes decay; hopes decay.'),
(19491, 'Decay', 'v. t.', 'To cause to decay; to impair.'),
(19492, 'Decay', 'v. t.', 'To destroy.'),
(19493, 'Decay', 'n.', 'Gradual failure of health, strength, soundness, prosperity,\n   or of any species of excellence or perfection; tendency toward\n   dissolution or extinction; corruption; rottenness; decline;\n   deterioration; as, the decay of the body; the decay of virtue; the\n   decay of the Roman empire; a castle in decay.'),
(19494, 'Decay', 'n.', 'Destruction; death.'),
(19495, 'Decay', 'n.', 'Cause of decay.'),
(19496, 'Decayed', 'a.', 'Fallen, as to physical or social condition; affected with\n   decay; rotten; as, decayed vegetation or vegetables; a decayed fortune\n   or gentleman.'),
(19497, 'Decayer', 'n.', 'A causer of decay.'),
(19498, 'Decease', 'n.', 'Departure, especially departure from this life; death.'),
(19499, 'Deceased', 'imp. & p. p.', 'of Decease'),
(19500, 'Decease', 'v. i.', 'To depart from this life; to die; to pass away.'),
(19501, 'Deceased', 'a.', 'Passed away; dead; gone.'),
(19502, 'Decede', 'n.', 'To withdraw.'),
(19503, 'Decedent', 'a.', 'Removing; departing.'),
(19504, 'Decedent', 'n.', 'A deceased person.'),
(19505, 'Deceit', 'n.', 'An attempt or disposition to deceive or lead into error;\n   any declaration, artifice, or practice, which misleads another, or\n   causes him to believe what is false; a contrivance to entrap;\n   deception; a wily device; fraud.'),
(19506, 'Deceit', 'n.', 'Any trick, collusion, contrivance, false representation, or\n   underhand practice, used to defraud another. When injury is thereby\n   effected, an action of deceit, as it called, lies for compensation.'),
(19507, 'Deceived', 'imp. & p. p.', 'of Deceive'),
(19508, 'Deceive', 'v. t.', 'To lead into error; to cause to believe what is false,\n   or disbelieve what is true; to impose upon; to mislead; to cheat; to\n   disappoint; to delude; to insnare.'),
(19509, 'Deceive', 'v. t.', 'To beguile; to amuse, so as to divert the attention; to\n   while away; to take away as if by deception.'),
(19510, 'Deceive', 'v. t.', 'To deprive by fraud or stealth; to defraud.'),
(19511, 'Deceiver', 'n.', 'One who deceives; one who leads into error; a cheat; an\n   impostor.'),
(19512, 'December', 'n.', 'The twelfth and last month of the year, containing\n   thirty-one days. During this month occurs the winter solstice.'),
(19513, 'December', 'n.', 'Fig.: With reference to the end of the year and to the\n   winter season; as, the December of his life.'),
(19514, 'Decemfid', 'a.', 'Cleft into ten parts.'),
(19515, 'Decemvir', 'n.', 'One of a body of ten magistrates in ancient Rome.'),
(19516, 'Decemvir', 'n.', 'A member of any body of ten men in authority.'),
(19517, 'Decence', 'n.', 'Decency.'),
(19518, 'Decency', 'n.', 'The quality or state of being decent, suitable, or\n   becoming, in words or behavior; propriety of form in social\n   intercourse, in actions, or in discourse; proper formality; becoming\n   ceremony; seemliness; hence, freedom from obscenity or indecorum;\n   modesty.'),
(19519, 'Decency', 'n.', 'That which is proper or becoming.'),
(19520, 'Decene', 'n.', 'One of the higher hydrocarbons, C10H20, of the ethylene\n   series.'),
(19521, 'Decennia', 'pl. ', 'of Decennium'),
(19522, 'Decent', 'a.', 'Suitable in words, behavior, dress, or ceremony; becoming;\n   fit; decorous; proper; seemly; as, decent conduct; decent language.'),
(19523, 'Decent', 'a.', 'Free from immodesty or obscenity; modest.'),
(19524, 'Decent', 'a.', 'Comely; shapely; well-formed.'),
(19525, 'Decent', 'a.', 'Moderate, but competent; sufficient; hence, respectable;\n   fairly good; reasonably comfortable or satisfying; as, a decent\n   fortune; a decent person.'),
(19526, 'Decern', 'v. t.', 'To perceive, discern, or decide.'),
(19527, 'Decern', 'v. t.', 'To decree; to adjudge.'),
(19528, 'Decerp', 'v. t.', 'To pluck off; to crop; to gather.'),
(19529, 'Decerpt', 'a.', 'Plucked off or away.'),
(19530, 'Decharm', 'v. t.', 'To free from a charm; to disenchant.'),
(19531, 'Decided', 'imp. & p. p.', 'of Decide'),
(19532, 'Deciding', 'p. pr. & vb. n.', 'of Decide'),
(19533, 'Decide', 'v. t.', 'To cut off; to separate.'),
(19534, 'Decide', 'v. t.', 'To bring to a termination, as a question, controversy,\n   struggle, by giving the victory to one side or party; to render\n   judgment concerning; to determine; to settle.'),
(19535, 'Decide', 'v. i.', 'To determine; to form a definite opinion; to come to a\n   conclusion; to give decision; as, the court decided in favor of the\n   defendant.'),
(19536, 'Decided', 'a.', 'Free from ambiguity; unequivocal; unmistakable;\n   unquestionable; clear; evident; as, a decided advantage.'),
(19537, 'Decided', 'a.', 'Free from doubt or wavering; determined; of fixed purpose;\n   fully settled; positive; resolute; as, a decided opinion or purpose.'),
(19538, 'Decider', 'n.', 'One who decides.'),
(19539, 'Decidua', 'n.', 'The inner layer of the wall of the uterus, which envelops\n   the embryo, forms a part of the placenta, and is discharged with it.'),
(19540, 'Decigram', 'n.', 'Alt. of Decigramme'),
(19541, 'Decil', 'n.', 'Alt. of Decile'),
(19542, 'Decile', 'n.', 'An aspect or position of two planets, when they are distant\n   from each other a tenth part of the zodiac, or 36¡.'),
(19543, 'Decimal', 'a.', 'Of or pertaining to decimals; numbered or proceeding by\n   tens; having a tenfold increase or decrease, each unit being ten times\n   the unit next smaller; as, decimal notation; a decimal coinage.'),
(19544, 'Decimal', 'n.', 'A number expressed in the scale of tens; specifically, and\n   almost exclusively, used as synonymous with a decimal fraction.'),
(19545, 'Decimate', 'v. t.', 'To take the tenth part of; to tithe.'),
(19546, 'Decimate', 'v. t.', 'To select by lot and punish with death every tenth man\n   of; as, to decimate a regiment as a punishment for mutiny.'),
(19547, 'Decimate', 'v. t.', 'To destroy a considerable part of; as, to decimate an\n   army in battle; to decimate a people by disease.'),
(19548, 'Decime', 'n.', 'A French coin, the tenth part of a franc, equal to about\n   two cents.'),
(19549, 'Decine', 'n.', 'One of the higher hydrocarbons, C10H15, of the acetylene\n   series; -- called also decenylene.'),
(19550, 'Decipher', 'v. t.', 'To translate from secret characters or ciphers into\n   intelligible terms; as, to decipher a letter written in secret\n   characters.'),
(19551, 'Decipher', 'v. t.', 'To find out, so as to be able to make known the\n   meaning of; to make out or read, as words badly written or partly\n   obliterated; to detect; to reveal; to unfold.'),
(19552, 'Decipher', 'v. t.', 'To stamp; to detect; to discover.'),
(19553, 'Decipium', 'n.', 'A supposed rare element, said to be associated with\n   cerium, yttrium, etc., in the mineral samarskite, and more recently\n   called samarium. Symbol Dp. See Samarium.'),
(19554, 'Decision', 'n.', 'Cutting off; division; detachment of a part.'),
(19555, 'Decision', 'n.', 'The act of deciding; act of settling or terminating, as a\n   controversy, by giving judgment on the matter at issue; determination,\n   as of a question or doubt; settlement; conclusion.'),
(19556, 'Decision', 'n.', 'An account or report of a conclusion, especially of a\n   legal adjudication or judicial determination of a question or cause;\n   as, a decision of arbitrators; a decision of the Supreme Court.'),
(19557, 'Decision', 'n.', 'The quality of being decided; prompt and fixed\n   determination; unwavering firmness; as, to manifest great decision.'),
(19558, 'Decisive', 'a.', 'Having the power or quality of deciding a question or\n   controversy; putting an end to contest or controversy; final;\n   conclusive.'),
(19559, 'Decisive', 'a.', 'Marked by promptness and decision.'),
(19560, 'Decisory', 'a.', 'Able to decide or determine; having a tendency to decide.'),
(19561, 'Decked', 'imp. & p. p.', 'of Deck'),
(19562, 'Decking', 'p. pr. & vb. n.', 'of Deck'),
(19563, 'Deckel', 'n.', 'Same as Deckle.'),
(19564, 'Decker', 'n.', 'One who, or that which, decks or adorns; a coverer; as, a\n   table decker.'),
(19565, 'Decker', 'n.', 'A vessel which has a deck or decks; -- used esp. in\n   composition; as, a single-decker; a three-decker.'),
(19566, 'Deckle', 'n.', 'A separate thin wooden frame used to form the border of a\n   hand mold, or a curb of India rubber or other material which rests on,\n   and forms the edge of, the mold in a paper machine and determines the\n   width of the paper.'),
(19567, 'Declaim', 'v. i.', 'To speak rhetorically; to make a formal speech or\n   oration; to harangue; specifically, to recite a speech, poem, etc., in\n   public as a rhetorical exercise; to practice public speaking; as, the\n   students declaim twice a week.'),
(19568, 'Declaim', 'v. i.', 'To speak for rhetorical display; to speak pompously,\n   noisily, or theatrically; to make an empty speech; to rehearse trite\n   arguments in debate; to rant.'),
(19569, 'Declaim', 'v. t.', 'To utter in public; to deliver in a rhetorical or set\n   manner.'),
(19570, 'Declaim', 'v. t.', 'To defend by declamation; to advocate loudly.'),
(19571, 'Declared', 'imp. & p. p.', 'of Declare'),
(19572, 'Declare', 'v. t.', 'To make clear; to free from obscurity.'),
(19573, 'Declare', 'v. t.', 'To make known by language; to communicate or manifest\n   explicitly and plainly in any way; to exhibit; to publish; to proclaim;\n   to announce.'),
(19574, 'Declare', 'v. t.', 'To make declaration of; to assert; to affirm; to set\n   forth; to avow; as, he declares the story to be false.'),
(19575, 'Declare', 'v. t.', 'To make full statement of, as goods, etc., for the\n   purpose of paying taxes, duties, etc.'),
(19576, 'Declare', 'v. i.', 'To make a declaration, or an open and explicit avowal;\n   to proclaim one\'s self; -- often with for or against; as, victory\n   declares against the allies.'),
(19577, 'Declare', 'v. i.', 'To state the plaintiff\'s cause of action at law in a\n   legal form; as, the plaintiff declares in trespass.'),
(19578, 'Declarer', 'n.', 'One who makes known or proclaims; that which exhibits.'),
(19579, 'Declinal', 'a.', 'Declining; sloping.'),
(19580, 'Declined', 'imp. & p. p.', 'of Decline'),
(19581, 'Decline', 'v. i.', 'To bend, or lean downward; to take a downward\n   direction; to bend over or hang down, as from weakness, weariness,\n   despondency, etc.; to condescend.'),
(19582, 'Decline', 'v. i.', 'To tend or draw towards a close, decay, or extinction;\n   to tend to a less perfect state; to become diminished or impaired; to\n   fail; to sink; to diminish; to lessen; as, the day declines; virtue\n   declines; religion declines; business declines.'),
(19583, 'Decline', 'v. i.', 'To turn or bend aside; to deviate; to stray; to\n   withdraw; as, a line that declines from straightness; conduct that\n   declines from sound morals.'),
(19584, 'Decline', 'v. i.', 'To turn away; to shun; to refuse; -- the opposite of\n   accept or consent; as, he declined, upon principle.'),
(19585, 'Decline', 'v. t.', 'To bend downward; to bring down; to depress; to cause\n   to bend, or fall.'),
(19586, 'Decline', 'v. t.', 'To cause to decrease or diminish.'),
(19587, 'Decline', 'v. t.', 'To put or turn aside; to turn off or away from; to\n   refuse to undertake or comply with; reject; to shun; to avoid; as, to\n   decline an offer; to decline a contest; he declined any participation\n   with them.'),
(19588, 'Decline', 'v. t.', 'To inflect, or rehearse in order the changes of\n   grammatical form of; as, to decline a noun or an adjective.'),
(19589, 'Decline', 'v. t.', 'To run through from first to last; to repeat like a\n   schoolboy declining a noun.'),
(19590, 'Decline', 'v. i.', 'A falling off; a tendency to a worse state; diminution\n   or decay; deterioration; also, the period when a thing is tending\n   toward extinction or a less perfect state; as, the decline of life; the\n   decline of strength; the decline of virtue and religion.'),
(19591, 'Decline', 'v. i.', 'That period of a disorder or paroxysm when the symptoms\n   begin to abate in violence; as, the decline of a fever.'),
(19592, 'Decline', 'v. i.', 'A gradual sinking and wasting away of the physical\n   faculties; any wasting disease, esp. pulmonary consumption; as, to die\n   of a decline.'),
(19593, 'Declined', 'a.', 'Declinate.'),
(19594, 'Decliner', 'n.', 'He who declines or rejects.'),
(19595, 'Decocted', 'imp. & p. p.', 'of Decoct'),
(19596, 'Decoct', 'v. t.', 'To prepare by boiling; to digest in hot or boiling\n   water; to extract the strength or flavor of by boiling; to make an\n   infusion of.'),
(19597, 'Decoct', 'v. t.', 'To prepare by the heat of the stomach for assimilation;\n   to digest; to concoct.'),
(19598, 'Decoct', 'v. t.', 'To warm, strengthen, or invigorate, as if by boiling.'),
(19599, 'Decolor', 'v. t.', 'To deprive of color; to bleach.'),
(19600, 'Decorate', 'v. t.', 'To deck with that which is becoming, ornamental, or\n   honorary; to adorn; to beautify; to embellish; as, to decorate the\n   person; to decorate an edifice; to decorate a lawn with flowers; to\n   decorate the mind with moral beauties; to decorate a hero with honors.'),
(19601, 'Decore', 'v. t.', 'To decorate; to beautify.'),
(19602, 'Decorous', 'a.', 'Suitable to a character, or to the time, place, and\n   occasion; marked with decorum; becoming; proper; seemly; befitting; as,\n   a decorous speech; decorous behavior; a decorous dress for a judge.'),
(19603, 'Decorum', 'n.', 'Propriety of manner or conduct; grace arising from\n   suitableness of speech and behavior to one\'s own character, or to the\n   place and occasion; decency of conduct; seemliness; that which is\n   seemly or suitable.'),
(19604, 'Decoyed', 'imp. & p. p.', 'of Decoy'),
(19605, 'Decoying', 'p. pr. & vb. n.', 'of Decoy'),
(19606, 'Decoy', 'v. t.', 'To lead into danger by artifice; to lure into a net or\n   snare; to entrap; to insnare; to allure; to entice; as, to decoy troops\n   into an ambush; to decoy ducks into a net.'),
(19607, 'Decoy', 'n.', 'Anything intended to lead into a snare; a lure that deceives\n   and misleads into danger, or into the power of an enemy; a bait.'),
(19608, 'Decoy', 'n.', 'A fowl, or the likeness of one, used by sportsmen to entice\n   other fowl into a net or within shot.'),
(19609, 'Decoy', 'n.', 'A place into which wild fowl, esp. ducks, are enticed in\n   order to take or shoot them.'),
(19610, 'Decoy', 'n.', 'A person employed by officers of justice, or parties exposed\n   to injury, to induce a suspected person to commit an offense under\n   circumstances that will lead to his detection.'),
(19611, 'Decoyer', 'n.', 'One who decoys another.'),
(19612, 'Decrease', 'n.', 'To grow less, -- opposed to increase; to be diminished\n   gradually, in size, degree, number, duration, etc., or in strength,\n   quality, or excellence; as, they days decrease in length from June to\n   December.'),
(19613, 'Decrease', 'v. t.', 'To cause to grow less; to diminish gradually; as,\n   extravagance decreases one\'s means.'),
(19614, 'Decrease', 'v.', 'A becoming less; gradual diminution; decay; as, a\n   decrease of revenue or of strength.'),
(19615, 'Decrease', 'v.', 'The wane of the moon.'),
(19616, 'Decree', 'n.', 'An order from one having authority, deciding what is to be\n   done by a subordinate; also, a determination by one having power,\n   deciding what is to be done or to take place; edict, law; authoritative\n   ru// decision.'),
(19617, 'Decree', 'n.', 'A decision, order, or sentence, given in a cause by a court\n   of equity or admiralty.'),
(19618, 'Decree', 'n.', 'A determination or judgment of an umpire on a case\n   submitted to him.'),
(19619, 'Decree', 'n.', 'An edict or law made by a council for regulating any\n   business within their jurisdiction; as, the decrees of ecclesiastical\n   councils.'),
(19620, 'Decreed', 'imp. & p. p.', 'of Decree'),
(19621, 'Decree', 'v. t.', 'To determine judicially by authority, or by decree; to\n   constitute by edict; to appoint by decree or law; to determine; to\n   order; to ordain; as, a court decrees a restoration of property.'),
(19622, 'Decree', 'v. t.', 'To ordain by fate.'),
(19623, 'Decree', 'v. i.', 'To make decrees; -- used absolutely.'),
(19624, 'Decreer', 'n.', 'One who decrees.'),
(19625, 'Decreet', 'n.', 'The final judgment of the Court of Session, or of an\n   inferior court, by which the question at issue is decided.'),
(19626, 'Decrepit', 'a.', 'Broken down with age; wasted and enfeebled by the\n   infirmities of old age; feeble; worn out.'),
(19627, 'Decretal', 'a.', 'Appertaining to a decree; containing a decree; as, a\n   decretal epistle.'),
(19628, 'Decretal', 'a.', 'An authoritative order or decree; especially, a letter of\n   the pope, determining some point or question in ecclesiastical law. The\n   decretals form the second part of the canon law.'),
(19629, 'Decretal', 'a.', 'The collection of ecclesiastical decrees and decisions\n   made, by order of Gregory IX., in 1234, by St. Raymond of Pennafort.'),
(19630, 'Decrete', 'n.', 'A decree.'),
(19631, 'Decrew', 'v. i.', 'To decrease.'),
(19632, 'Decrial', 'n.', 'A crying down; a clamorous censure; condemnation by\n   censure.'),
(19633, 'Decrier', 'n.', 'One who decries.'),
(19634, 'Decrown', 'v. t.', 'To deprive of a crown; to discrown.'),
(19635, 'Decried', 'imp. & p. p.', 'of Decry'),
(19636, 'Decrying', 'p. pr. & vb. n.', 'of Decry'),
(19637, 'Decry', 'v. t.', 'To cry down; to censure as faulty, mean, or worthless; to\n   clamor against; to blame clamorously; to discredit; to disparage.'),
(19638, 'Decuman', 'a.', 'Large; chief; -- applied to an extraordinary billow,\n   supposed by some to be every tenth in order. [R.] Also used\n   substantively.'),
(19639, 'Decuple', 'a.', 'Tenfold.'),
(19640, 'Decuple', 'n.', 'A number ten times repeated.'),
(19641, 'Decupled', 'imp. & p. p.', 'of Decuple'),
(19642, 'Decuple', 'v. t.', 'To make tenfold; to multiply by ten.'),
(19643, 'Decurion', 'n.', 'A head or chief over ten; especially, an officer who\n   commanded a division of ten soldiers.'),
(19644, 'Decurt', 'v. t.', 'To cut short; to curtail.'),
(19645, 'Decuries', 'pl. ', 'of Decury'),
(19646, 'Decury', 'n.', 'A set or squad of ten men under a decurion.'),
(19647, 'Decyl', 'n.', 'A hydrocarbon radical, C10H21, never existing alone, but\n   regarded as the characteristic constituent of a number of compounds of\n   the paraffin series.'),
(19648, 'Decylic', 'a.', 'Allied to, or containing, the radical decyl.'),
(19649, 'Dedalian', 'a.', 'See Daedalian.'),
(19650, 'Dedalous', 'a.', 'See Daedalous.'),
(19651, 'Dedans', 'n.', 'A division, at one end of a tennis court, for spectators.'),
(19652, 'Dedicate', 'p. a.', 'Dedicated; set apart; devoted; consecrated.'),
(19653, 'Dedicate', 'v. t.', 'To set apart and consecrate, as to a divinity, or for\n   sacred uses; to devote formally and solemnly; as, to dedicate vessels,\n   treasures, a temple, or a church, to a religious use.'),
(19654, 'Dedicate', 'v. t.', 'To devote, set apart, or give up, as one\'s self, to a\n   duty or service.'),
(19655, 'Dedicate', 'v. t.', 'To inscribe or address, as to a patron.'),
(19656, 'Dedimus', 'n.', 'A writ to commission private persons to do some act in\n   place of a judge, as to examine a witness, etc.'),
(19657, 'Dedition', 'n.', 'The act of yielding; surrender.'),
(19658, 'Dedolent', 'a.', 'Feeling no compunction; apathetic.'),
(19659, 'Deduced', 'imp. & p. p.', 'of Deduce'),
(19660, 'Deducing', 'p. pr. & vb. n.', 'of Deduce'),
(19661, 'Deduce', 'v. t.', 'To lead forth.'),
(19662, 'Deduce', 'v. t.', 'To take away; to deduct; to subtract; as, to deduce a\n   part from the whole.'),
(19663, 'Deduce', 'v. t.', 'To derive or draw; to derive by logical process; to\n   obtain or arrive at as the result of reasoning; to gather, as a truth\n   or opinion, from what precedes or from premises; to infer; -- with from\n   or out of.'),
(19664, 'Deducive', 'a.', 'That deduces; inferential.'),
(19665, 'Deducted', 'imp. & p. p.', 'of Deduct'),
(19666, 'Deduct', 'v. t.', 'To lead forth or out.'),
(19667, 'Deduct', 'v. t.', 'To take away, separate, or remove, in numbering,\n   estimating, or calculating; to subtract; -- often with from or out of.'),
(19668, 'Deduct', 'v. t.', 'To reduce; to diminish.'),
(19669, 'Deductor', 'n.', 'The pilot whale or blackfish.'),
(19670, 'Deduit', 'n.', 'Delight; pleasure.'),
(19671, 'Deedful', 'a.', 'Full of deeds or exploits; active; stirring.'),
(19672, 'Deedless', 'a.', 'Not performing, or not having performed, deeds or\n   exploits; inactive.'),
(19673, 'Deedy', 'a.', 'Industrious; active.'),
(19674, 'Deemed', 'imp. & p. p.', 'of Deem'),
(19675, 'Deeming', 'p. pr. & vb. n.', 'of Deem'),
(19676, 'Deemster', 'n.', 'A judge in the Isle of Man who decides controversies\n   without process.'),
(19677, 'Deepened', 'imp. & p. p.', 'of Deepen'),
(19678, 'Deepen', 'v. t.', 'To make deep or deeper; to increase the depth of; to\n   sink lower; as, to deepen a well or a channel.'),
(19679, 'Deepen', 'v. t.', 'To make darker or more intense; to darken; as, the event\n   deepened the prevailing gloom.'),
(19680, 'Deepen', 'v. t.', 'To make more poignant or affecting; to increase in\n   degree; as, to deepen grief or sorrow.'),
(19681, 'Deepen', 'v. t.', 'To make more grave or low in tone; as, to deepen the\n   tones of an organ.'),
(19682, 'Deepen', 'v. i.', 'To become deeper; as, the water deepens at every cast of\n   the lead; the plot deepens.'),
(19683, 'Deep-fet', 'a.', 'Deeply fetched or drawn.'),
(19684, 'Deeply', 'adv.', 'At or to a great depth; far below the surface; as, to\n   sink deeply.'),
(19685, 'Deeply', 'adv.', 'Profoundly; thoroughly; not superficially; in a high\n   degree; intensely; as, deeply skilled in ethics.'),
(19686, 'Deeply', 'adv.', 'Very; with a tendency to darkness of color.'),
(19687, 'Deeply', 'adv.', 'Gravely; with low or deep tone; as, a deeply toned\n   instrument.'),
(19688, 'Deeply', 'adv.', 'With profound skill; with art or intricacy; as, a deeply\n   laid plot or intrigue.'),
(19689, 'Deepness', 'n.', 'The state or quality of being deep, profound, mysterious,\n   secretive, etc.; depth; profundity; -- opposed to shallowness.'),
(19690, 'Deepness', 'n.', 'Craft; insidiousness.'),
(19691, 'Deep-sea', 'a.', 'Of or pertaining to the deeper parts of the sea; as, a\n   deep-sea line (i. e., a line to take soundings at a great depth);\n   deep-sea lead; deep-sea soundings, explorations, etc.'),
(19692, 'Deerlet', 'n.', 'A chevrotain. See Kanchil, and Napu.'),
(19693, 'Deerskin', 'n.', 'The skin of a deer, or the leather which is made from it.'),
(19694, 'Deesis', 'n.', 'An invocation of, or address to, the Supreme Being.'),
(19695, 'Deess', 'n.', 'A goddess.'),
(19696, 'Defaced', 'imp. & p. p.', 'of Deface'),
(19697, 'Defacing', 'p. pr. & vb. n.', 'of Deface'),
(19698, 'Deface', 'v. t.', 'To destroy or mar the face or external appearance of; to\n   disfigure; to injure, spoil, or mar, by effacing or obliterating\n   important features or portions of; as, to deface a monument; to deface\n   an edifice; to deface writing; to deface a note, deed, or bond; to\n   deface a record.'),
(19699, 'Deface', 'v. t.', 'To destroy; to make null.'),
(19700, 'Defacer', 'n.', 'One who, or that which, defaces or disfigures.'),
(19701, 'De facto', '', 'Actually; in fact; in reality; as, a king de facto, --\n   distinguished from a king de jure, or by right.'),
(19702, 'Defail', 'v. t.', 'To cause to fail.'),
(19703, 'Defalk', 'v. t.', 'To lop off; to abate.'),
(19704, 'Defamed', 'imp. & p. p.', 'of Defame'),
(19705, 'Defaming', 'p. pr. & vb. n.', 'of Defame'),
(19706, 'Defame', 'v. t.', 'To harm or destroy the good fame or reputation of; to\n   disgrace; especially, to speak evil of maliciously; to dishonor by\n   slanderous reports; to calumniate; to asperse.'),
(19707, 'Defame', 'v. t.', 'To render infamous; to bring into disrepute.'),
(19708, 'Defame', 'v. t.', 'To charge; to accuse.'),
(19709, 'Defame', 'n.', 'Dishonor.'),
(19710, 'Defamer', 'n.', 'One who defames; a slanderer; a detractor; a calumniator.'),
(19711, 'Defamous', 'a.', 'Defamatory.'),
(19712, 'Default', 'n.', 'A failing or failure; omission of that which ought to be\n   done; neglect to do what duty or law requires; as, this evil has\n   happened through the governor\'s default.'),
(19713, 'Default', 'n.', 'Fault; offense; ill deed; wrong act; failure in virtue or\n   wisdom.'),
(19714, 'Default', 'n.', 'A neglect of, or failure to take, some step necessary to\n   secure the benefit of law, as a failure to appear in court at a day\n   assigned, especially of the defendant in a suit when called to make\n   answer; also of jurors, witnesses, etc.'),
(19715, 'Default', 'v. i.', 'To fail in duty; to offend.'),
(19716, 'Default', 'v. i.', 'To fail in fulfilling a contract, agreement, or duty.'),
(19717, 'Default', 'v. i.', 'To fail to appear in court; to let a case go by\n   default.'),
(19718, 'Default', 'v. t.', 'To fail to perform or pay; to be guilty of neglect of;\n   to omit; as, to default a dividend.'),
(19719, 'Default', 'v. t.', 'To call a defendant or other party whose duty it is to\n   be present in court, and make entry of his default, if he fails to\n   appear; to enter a default against.'),
(19720, 'Default', 'v. t.', 'To leave out of account; to omit.'),
(19721, 'Defeated', 'imp. & p. p.', 'of Defeat'),
(19722, 'Defeat', 'v. t.', 'To undo; to disfigure; to destroy.'),
(19723, 'Defeat', 'v. t.', 'To render null and void, as a title; to frustrate, as\n   hope; to deprive, as of an estate.'),
(19724, 'Defeat', 'v. t.', 'To overcome or vanquish, as an army; to check, disperse,\n   or ruin by victory; to overthrow.'),
(19725, 'Defeat', 'v. t.', 'To resist with success; as, to defeat an assault.'),
(19726, 'Defeat', 'v.', 'An undoing or annulling; destruction.'),
(19727, 'Defeat', 'v.', 'Frustration by rendering null and void, or by prevention of\n   success; as, the defeat of a plan or design.'),
(19728, 'Defeat', 'v.', 'An overthrow, as of an army in battle; loss of a battle;\n   repulse suffered; discomfiture; -- opposed to victory.'),
(19729, 'Defecate', 'a.', 'Freed from anything that can pollute, as dregs, lees,\n   etc.; refined; purified.'),
(19730, 'Defecate', 'v. t.', 'To clear from impurities, as lees, dregs, etc.; to\n   clarify; to purify; to refine.'),
(19731, 'Defecate', 'v. t.', 'To free from extraneous or polluting matter; to clear;\n   to purify, as from that which materializes.'),
(19732, 'Defecate', 'v. i.', 'To become clear, pure, or free.'),
(19733, 'Defecate', 'v. i.', 'To void excrement.'),
(19734, 'Defect', 'n.', 'Want or absence of something necessary for completeness or\n   perfection; deficiency; -- opposed to superfluity.'),
(19735, 'Defect', 'n.', 'Failing; fault; imperfection, whether physical or moral;\n   blemish; as, a defect in the ear or eye; a defect in timber or iron; a\n   defect of memory or judgment.'),
(19736, 'Defect', 'v. i.', 'To fail; to become deficient.'),
(19737, 'Defect', 'v. t.', 'To injure; to damage.'),
(19738, 'Defence', 'n. & v. t.', 'See Defense.'),
(19739, 'Defended', 'imp. & p. p.', 'of Defend'),
(19740, 'Defend', 'v. t.', 'To ward or fend off; to drive back or away; to repel.'),
(19741, 'Defend', 'v. t.', 'To prohibit; to forbid.'),
(19742, 'Defend', 'v. t.', 'To repel danger or harm from; to protect; to secure\n   against; attack; to maintain against force or argument; to uphold; to\n   guard; as, to defend a town; to defend a cause; to defend character; to\n   defend the absent; -- sometimes followed by from or against; as, to\n   defend one\'s self from, or against, one\'s enemies.'),
(19743, 'Defend', 'v. t.', 'To deny the right of the plaintiff in regard to (the\n   suit, or the wrong charged); to oppose or resist, as a claim at law; to\n   contest, as a suit.'),
(19744, 'Defendee', 'n.', 'One who is defended.'),
(19745, 'Defender', 'n.', 'One who defends; one who maintains, supports, protects,\n   or vindicates; a champion; an advocate; a vindicator.'),
(19746, 'Defense', 'n.', 'Alt. of Defence'),
(19747, 'Defence', 'n.', 'The act of defending, or the state of being defended;\n   protection, as from violence or danger.'),
(19748, 'Defence', 'n.', 'That which defends or protects; anything employed to\n   oppose attack, ward off violence or danger, or maintain security; a\n   guard; a protection.'),
(19749, 'Defence', 'n.', 'Protecting plea; vindication; justification.'),
(19750, 'Defence', 'n.', 'The defendant\'s answer or plea; an opposing or denial of\n   the truth or validity of the plaintiff\'s or prosecutor\'s case; the\n   method of proceeding adopted by the defendant to protect himself\n   against the plaintiff\'s action.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(19751, 'Defence', 'n.', 'Act or skill in making defense; defensive plan or policy;\n   practice in self defense, as in fencing, boxing, etc.'),
(19752, 'Defence', 'n.', 'Prohibition; a prohibitory ordinance.'),
(19753, 'Defense', 'v. t.', 'To furnish with defenses; to fortify.'),
(19754, 'Defenser', 'n.', 'Defender.'),
(19755, 'Defensor', 'n.', 'A defender.'),
(19756, 'Defensor', 'n.', 'A defender or an advocate in court; a guardian or\n   protector.'),
(19757, 'Defensor', 'n.', 'The patron of a church; an officer having charge of the\n   temporal affairs of a church.'),
(19758, 'Deferred', 'imp. & p. p.', 'of Defer'),
(19759, 'Defer', 'v. t.', 'To put off; to postpone to a future time; to delay the\n   execution of; to delay; to withhold.'),
(19760, 'Defer', 'v. i.', 'To put off; to delay to act; to wait.'),
(19761, 'Defer', 'v. t.', 'To render or offer.'),
(19762, 'Defer', 'v. t.', 'To lay before; to submit in a respectful manner; to\n   refer; -- with to.'),
(19763, 'Defer', 'v. i.', 'To yield deference to the wishes of another; to submit to\n   the opinion of another, or to authority; -- with to.'),
(19764, 'Deferent', 'a.', 'Serving to carry; bearing.'),
(19765, 'Deferent', 'n.', 'That which carries or conveys.'),
(19766, 'Deferent', 'n.', 'An imaginary circle surrounding the earth, in whose\n   periphery either the heavenly body or the center of the heavenly body\'s\n   epicycle was supposed to be carried round.'),
(19767, 'Deferrer', 'n.', 'One who defers or puts off.'),
(19768, 'Defiance', 'n.', 'The act of defying, putting in opposition, or provoking\n   to combat; a challenge; a provocation; a summons to combat.'),
(19769, 'Defiance', 'n.', 'A state of opposition; willingness to flight; disposition\n   to resist; contempt of opposition.'),
