(20001, 'Deliver', 'v. t.', 'To set free from restraint; to set at liberty; to\n   release; to liberate, as from control; to give up; to free; to save; to\n   rescue from evil actual or feared; -- often with from or out of; as, to\n   deliver one from captivity, or from fear of death.'),
(20002, 'Deliver', 'v. t.', 'To give or transfer; to yield possession or control of;\n   to part with (to); to make over; to commit; to surrender; to resign; --\n   often with up or over, to or into.'),
(20003, 'Deliver', 'v. t.', 'To make over to the knowledge of another; to\n   communicate; to utter; to speak; to impart.'),
(20004, 'Deliver', 'v. t.', 'To give forth in action or exercise; to discharge; as,\n   to deliver a blow; to deliver a broadside, or a ball.'),
(20005, 'Deliver', 'v. t.', 'To free from, or disburden of, young; to relieve of a\n   child in childbirth; to bring forth; -- often with of.'),
(20006, 'Deliver', 'v. t.', 'To discover; to show.'),
(20007, 'Deliver', 'v. t.', 'To deliberate.'),
(20008, 'Deliver', 'v. t.', 'To admit; to allow to pass.'),
(20009, 'Deliver', 'v. t.', 'Free; nimble; sprightly; active.'),
(20010, 'Delivery', 'n.', 'The act of delivering from restraint; rescue; release;\n   liberation; as, the delivery of a captive from his dungeon.'),
(20011, 'Delivery', 'n.', 'The act of delivering up or over; surrender; transfer of\n   the body or substance of a thing; distribution; as, the delivery of a\n   fort, of hostages, of a criminal, of goods, of letters.'),
(20012, 'Delivery', 'n.', 'The act or style of utterance; manner of speaking; as, a\n   good delivery; a clear delivery.'),
(20013, 'Delivery', 'n.', 'The act of giving birth; parturition; the expulsion or\n   extraction of a fetus and its membranes.'),
(20014, 'Delivery', 'n.', 'The act of exerting one\'s strength or limbs.'),
(20015, 'Delivery', 'n.', 'The act or manner of delivering a ball; as, the pitcher\n   has a swift delivery.'),
(20016, 'Deloo', 'n.', 'The duykerbok.'),
(20017, 'Deloul', 'n.', 'A special breed of the dromedary used for rapid traveling;\n   the swift camel; -- called also herire, and maharik.'),
(20018, 'Delph', 'n.', 'Delftware.'),
(20019, 'Delph', 'n.', 'The drain on the land side of a sea embankment.'),
(20020, 'Delphian', 'a.', 'Delphic.'),
(20021, 'Delphic', 'a.', 'Of or relating to Delphi, or to the famous oracle of that\n   place.'),
(20022, 'Delphic', 'a.', 'Ambiguous; mysterious.'),
(20023, 'Delphin', 'a.', 'Alt. of Delphine'),
(20024, 'Delphine', 'a.', 'Pertaining to the dauphin of France; as, the Delphin\n   classics, an edition of the Latin classics, prepared in the reign of\n   Louis XIV., for the use of the dauphin (in usum Delphini).'),
(20025, 'Delphin', 'n.', 'A fatty substance contained in the oil of the dolphin and\n   the porpoise; -- called also phocenin.'),
(20026, 'Delphine', 'a.', 'Pertaining to the dolphin, a genus of fishes.'),
(20027, 'Deltas', 'pl. ', 'of Delta'),
(20028, 'Delta', 'n.', 'A tract of land shaped like the letter delta (/), especially\n   when the land is alluvial and inclosed between two or more mouths of a\n   river; as, the delta of the Ganges, of the Nile, or of the Mississippi.'),
(20029, 'Deltaic', 'a.', 'Relating to, or like, a delta.'),
(20030, 'Deltic', 'a.', 'Deltaic.'),
(20031, 'Deltoid', 'a.', 'Shaped like the Greek / (delta); delta-shaped; triangular.'),
(20032, 'Deluded', 'imp. & p. p.', 'of Delude'),
(20033, 'Deluding', 'p. pr. & vb. n.', 'of Delude'),
(20034, 'Delude', 'v. t.', 'To lead from truth or into error; to mislead the mind or\n   judgment of; to beguile; to impose on; to dupe; to make a fool of.'),
(20035, 'Delude', 'v. t.', 'To frustrate or disappoint.'),
(20036, 'Deluder', 'n.', 'One who deludes; a deceiver; an impostor.'),
(20037, 'Deluge', 'n.', 'A washing away; an overflowing of the land by water; an\n   inundation; a flood; specifically, The Deluge, the great flood in the\n   days of Noah (Gen. vii.).'),
(20038, 'Deluge', 'n.', 'Fig.: Anything which overwhelms, or causes great\n   destruction.'),
(20039, 'Deluged', 'imp. & p. p.', 'of Deluge'),
(20040, 'Deluging', 'p. pr. & vb. n.', 'of Deluge'),
(20041, 'Deluge', 'v. t.', 'To overflow with water; to inundate; to overwhelm.'),
(20042, 'Deluge', 'v. t.', 'To overwhelm, as with a deluge; to cover; to overspread;\n   to overpower; to submerge; to destroy; as, the northern nations deluged\n   the Roman empire with their armies; the land is deluged with woe.'),
(20043, 'Delusion', 'n.', 'The act of deluding; deception; a misleading of the mind.'),
(20044, 'Delusion', 'n.', 'The state of being deluded or misled.'),
(20045, 'Delusion', 'n.', 'That which is falsely or delusively believed or\n   propagated; false belief; error in belief.'),
(20046, 'Delusive', 'a.', 'Apt or fitted to delude; tending to mislead the mind;\n   deceptive; beguiling; delusory; as, delusive arts; a delusive dream.'),
(20047, 'Delusory', 'a.', 'Delusive; fallacious.'),
(20048, 'Delved', 'imp. & p. p.', 'of Delve'),
(20049, 'Delving', 'p. pr. & vb. n.', 'of Delve'),
(20050, 'Delve', 'v. t.', 'To dig; to open (the ground) as with a spade.'),
(20051, 'Delve', 'v. t.', 'To dig into; to penetrate; to trace out; to fathom.'),
(20052, 'Delve', 'v. i.', 'To dig or labor with a spade, or as with a spade; to\n   labor as a drudge.'),
(20053, 'Delve', 'v. t.', 'A place dug; a pit; a ditch; a den; a cave.'),
(20054, 'Delver', 'n.', 'One who digs, as with a spade.'),
(20055, 'Demagog', 'n.', 'Demagogue.'),
(20056, 'Demagogy', 'n.', 'Demagogism.'),
(20057, 'Demain', 'n.', 'Rule; management.'),
(20058, 'Demain', 'n.', 'See Demesne.'),
(20059, 'Demanded', 'imp. & p. p.', 'of Demand'),
(20060, 'Demand', 'v. t.', 'To ask or call for with authority; to claim or seek\n   from, as by authority or right; to claim, as something due; to call for\n   urgently or peremptorily; as, to demand a debt; to demand obedience.'),
(20061, 'Demand', 'v. t.', 'To inquire authoritatively or earnestly; to ask, esp. in\n   a peremptory manner; to question.'),
(20062, 'Demand', 'v. t.', 'To require as necessary or useful; to be in urgent need\n   of; hence, to call for; as, the case demands care.'),
(20063, 'Demand', 'v. t.', 'To call into court; to summon.'),
(20064, 'Demand', 'v. i.', 'To make a demand; to inquire.'),
(20065, 'Demand', 'v. t.', 'The act of demanding; an asking with authority; a\n   peremptory urging of a claim; a claiming or challenging as due;\n   requisition; as, the demand of a creditor; a note payable on demand.'),
(20066, 'Demand', 'v. t.', 'Earnest inquiry; question; query.'),
(20067, 'Demand', 'v. t.', 'A diligent seeking or search; manifested want; desire to\n   possess; request; as, a demand for certain goods; a person\'s company is\n   in great demand.'),
(20068, 'Demand', 'v. t.', 'That which one demands or has a right to demand; thing\n   claimed as due; claim; as, demands on an estate.'),
(20069, 'Demand', 'v. t.', 'The asking or seeking for what is due or claimed as due.'),
(20070, 'Demand', 'v. t.', 'The right or title in virtue of which anything may be\n   claimed; as, to hold a demand against a person.'),
(20071, 'Demand', 'v. t.', 'A thing or amount claimed to be due.'),
(20072, 'Demander', 'n.', 'One who demands.'),
(20073, 'Demarch', 'n.', 'March; walk; gait.'),
(20074, 'Demarch', 'n.', 'A chief or ruler of a deme or district in Greece.'),
(20075, 'Demeaned', 'imp. & p. p.', 'of Demean'),
(20076, 'Demean', 'v. t.', 'To manage; to conduct; to treat.'),
(20077, 'Demean', 'v. t.', 'To conduct; to behave; to comport; -- followed by the\n   reflexive pronoun.'),
(20078, 'Demean', 'v. t.', 'To debase; to lower; to degrade; -- followed by the\n   reflexive pronoun.'),
(20079, 'Demean', 'v. t.', 'Management; treatment.'),
(20080, 'Demean', 'v. t.', 'Behavior; conduct; bearing; demeanor.'),
(20081, 'Demean', 'n.', 'Demesne.'),
(20082, 'Demean', 'n.', 'Resources; means.'),
(20083, 'Demeanor', 'v. t.', 'Management; treatment; conduct.'),
(20084, 'Demeanor', 'v. t.', 'Behavior; deportment; carriage; bearing; mien.'),
(20085, 'Demency', 'n.', 'Dementia; loss of mental powers. See Insanity.'),
(20086, 'Dement', 'v. t.', 'To deprive of reason; to make mad.'),
(20087, 'Dement', 'a.', 'Demented; dementate.'),
(20088, 'Demented', 'a.', 'Insane; mad; of unsound mind.'),
(20089, 'Dementia', 'n.', 'Insanity; madness; esp. that form which consists in\n   weakness or total loss of thought and reason; mental imbecility;\n   idiocy.'),
(20090, 'Demerge', 'v. t.', 'To plunge down into; to sink; to immerse.'),
(20091, 'Demerit', 'n.', 'That which one merits or deserves, either of good or ill;\n   desert.'),
(20092, 'Demerit', 'n.', 'That which deserves blame; ill desert; a fault; a vice;\n   misconduct; -- the opposite of merit.'),
(20093, 'Demerit', 'n.', 'The state of one who deserves ill.'),
(20094, 'Demerit', 'n.', 'To deserve; -- said in reference to both praise and blame.'),
(20095, 'Demerit', 'n.', 'To depreciate or cry down.'),
(20096, 'Demerit', 'v. i.', 'To deserve praise or blame.'),
(20097, 'Demerse', 'v. t.', 'To immerse.'),
(20098, 'Demersed', 'a.', 'Situated or growing under water, as leaves; submersed.'),
(20099, 'Demesne', 'n.', 'A lord\'s chief manor place, with that part of the lands\n   belonging thereto which has not been granted out in tenancy; a house,\n   and the land adjoining, kept for the proprietor\'s own use.'),
(20100, 'Demi-', '', 'A prefix, signifying half.'),
(20101, 'Demigod', 'n.', 'A half god, or an inferior deity; a fabulous hero, the\n   offspring of a deity and a mortal.'),
(20102, 'Demijohn', 'n.', 'A glass vessel or bottle with a large body and small\n   neck, inclosed in wickerwork.'),
(20103, 'Demilune', 'n.', 'A work constructed beyond the main ditch of a fortress,\n   and in front of the curtain between two bastions, intended to defend\n   the curtain; a ravelin. See Ravelin.'),
(20104, 'Demilune', 'n.', 'A crescentic mass of granular protoplasm present in the\n   salivary glands.'),
(20105, 'Demiman', 'n.', 'A half man.'),
(20106, 'Demirep', 'n.', 'A woman of doubtful reputation or suspected character; an\n   adventuress.'),
(20107, 'Demise', 'n.', 'Transmission by formal act or conveyance to an heir or\n   successor; transference; especially, the transfer or transmission of\n   the crown or royal authority to a successor.'),
(20108, 'Demise', 'n.', 'The decease of a royal or princely person; hence, also, the\n   death of any illustrious person.'),
(20109, 'Demise', 'n.', 'The conveyance or transfer of an estate, either in fee for\n   life or for years, most commonly the latter.'),
(20110, 'Demised', 'imp. & p. p.', 'of Demise'),
(20111, 'Demising', 'p. pr. & vb. n.', 'of Demise'),
(20112, 'Demise', 'v. t.', 'To transfer or transmit by succession or inheritance; to\n   grant or bestow by will; to bequeath.'),
(20113, 'Demise', 'v. t.', 'To convey; to give.'),
(20114, 'Demise', 'v. t.', 'To convey, as an estate, by lease; to lease.'),
(20115, 'Demiss', 'a.', 'Cast down; humble; submissive.'),
(20116, 'Demissly', 'adv.', 'In a humble manner.'),
(20117, 'Demisuit', 'n.', 'A suit of light armor covering less than the whole body,\n   as having no protection for the legs below the thighs, no vizor to the\n   helmet, and the like.'),
(20118, 'Demitted', 'imp. & p. p.', 'of Demit'),
(20119, 'Demit', 'v. t.', 'To let fall; to depress.'),
(20120, 'Demit', 'v. t.', 'To yield or submit; to humble; to lower; as, to demit\n   one\'s self to humble duties.'),
(20121, 'Demit', 'v. t.', 'To lay down, as an office; to resign.'),
(20122, 'Demitint', 'n.', 'That part of a painting, engraving, or the like, which is\n   neither in full darkness nor full light.'),
(20123, 'Demitint', 'n.', 'The shade itself; neither the darkest nor the lightest in\n   a composition. Also called half tint.'),
(20124, 'Demitone', 'n.', 'Semitone.'),
(20125, 'Demiurge', 'n.', 'The chief magistrate in some of the Greek states.'),
(20126, 'Demiurge', 'n.', 'God, as the Maker of the world.'),
(20127, 'Demiurge', 'n.', 'According to the Gnostics, an agent or one employed by\n   the Supreme Being to create the material universe and man.'),
(20128, 'Demivill', 'n.', 'A half vill, consisting of five freemen or frankpledges.'),
(20129, 'Demivolt', 'n.', 'A half vault; one of the seven artificial motions of a\n   horse, in which he raises his fore legs in a particular manner.'),
(20130, 'Demiwolf', 'n.', 'A half wolf; a mongrel dog, between a dog and a wolf.'),
(20131, 'Democrat', 'n.', 'One who is an adherent or advocate of democracy, or\n   government by the people.'),
(20132, 'Democrat', 'n.', 'A member of the Democratic party.'),
(20133, 'Demolish', 'v. t.', 'To throw or pull down; to raze; to destroy the fabric\n   of; to pull to pieces; to ruin; as, to demolish an edifice, or a wall.'),
(20134, 'Demon', 'n.', 'A spirit, or immaterial being, holding a middle place\n   between men and deities in pagan mythology.'),
(20135, 'Demon', 'n.', 'One\'s genius; a tutelary spirit or internal voice; as, the\n   demon of Socrates.'),
(20136, 'Demon', 'n.', 'An evil spirit; a devil.'),
(20137, 'Demoness', 'n.', 'A female demon.'),
(20138, 'Demoniac', 'a.', 'Alt. of Demoniacal'),
(20139, 'Demoniac', 'n.', 'A human being possessed by a demon or evil spirit; one\n   whose faculties are directly controlled by a demon.'),
(20140, 'Demoniac', 'n.', 'One of a sect of Anabaptists who maintain that the demons\n   or devils will finally be saved.'),
(20141, 'Demonial', 'a.', 'Of or pertaining to a demon.'),
(20142, 'Demonian', 'a.', 'Relating to, or having the nature of, a demon.'),
(20143, 'Demonic', 'a.', 'Of or pertaining to a demon or to demons; demoniac.'),
(20144, 'Demonism', 'n.', 'The belief in demons or false gods.'),
(20145, 'Demonist', 'n.', 'A believer in, or worshiper of, demons.'),
(20146, 'Demonize', 'v. t.', 'To convert into a demon; to infuse the principles or\n   fury of a demon into.'),
(20147, 'Demonize', 'v. t.', 'To control or possess by a demon.'),
(20148, 'Demonomy', 'n.', 'The dominion of demons.'),
(20149, 'Demonry', 'n.', 'Demoniacal influence or possession.'),
(20150, 'Demorage', 'n.', 'Demurrage.'),
(20151, 'Demotic', 'a.', 'Of or pertaining to the people; popular; common.'),
(20152, 'Demount', 'v. i.', 'To dismount.'),
(20153, 'Dempne', 'v. t.', 'To damn; to condemn.'),
(20154, 'Dempster', 'n.', 'Alt. of Demster'),
(20155, 'Demster', 'n.', 'A deemster.'),
(20156, 'Demster', 'n.', 'An officer whose duty it was to announce the doom or\n   sentence pronounced by the court.'),
(20157, 'Demulce', 'v. t.', 'To soothe; to mollify; to pacify; to soften.'),
(20158, 'Demurred', 'imp. & p. p.', 'of Demur'),
(20159, 'Demur', 'v. i.', 'To linger; to stay; to tarry.'),
(20160, 'Demur', 'v. i.', 'To delay; to pause; to suspend proceedings or judgment in\n   view of a doubt or difficulty; to hesitate; to put off the\n   determination or conclusion of an affair.'),
(20161, 'Demur', 'v. i.', 'To scruple or object; to take exception; as, I demur to\n   that statement.'),
(20162, 'Demur', 'v. i.', 'To interpose a demurrer. See Demurrer, 2.'),
(20163, 'Demur', 'v. t.', 'To suspend judgment concerning; to doubt of or hesitate\n   about.'),
(20164, 'Demur', 'v. t.', 'To cause delay to; to put off.'),
(20165, 'Demur', 'v. i.', 'Stop; pause; hesitation as to proceeding; suspense of\n   decision or action; scruple.'),
(20166, 'Demure', 'a.', 'Of sober or serious mien; composed and decorous in bearing;\n   of modest look; staid; grave.'),
(20167, 'Demure', 'a.', 'Affectedly modest, decorous, or serious; making a show of\n   gravity.'),
(20168, 'Demure', 'v. i.', 'To look demurely.'),
(20169, 'Demurely', 'adv.', 'In a demure manner; soberly; gravely; -- now, commonly,\n   with a mere show of gravity or modesty.'),
(20170, 'Demurity', 'n.', 'Demureness; also, one who is demure.'),
(20171, 'Demurral', 'n.', 'Demur; delay in acting or deciding.'),
(20172, 'Demurrer', 'n.', 'One who demurs.'),
(20173, 'Demurrer', 'n.', 'A stop or pause by a party to an action, for the judgment\n   of the court on the question, whether, assuming the truth of the matter\n   alleged by the opposite party, it is sufficient in law to sustain the\n   action or defense, and hence whether the party resting is bound to\n   answer or proceed further.'),
(20174, 'Demies', 'pl. ', 'of Demy'),
(20175, 'Denarii', 'pl. ', 'of Denarius'),
(20176, 'Denarius', 'n.', 'A Roman silver coin of the value of about fourteen cents;\n   the \"penny\" of the New Testament; -- so called from being worth\n   originally ten of the pieces called as.'),
(20177, 'Denary', 'a.', 'Containing ten; tenfold; proceeding by tens; as, the\n   denary, or decimal, scale.'),
(20178, 'Denary', 'n.', 'The number ten; a division into ten.'),
(20179, 'Denary', 'n.', 'A coin; the Anglicized form of denarius.'),
(20180, 'Denay', 'v. t.', 'To deny.'),
(20181, 'Denay', 'n.', 'Denial; refusal.'),
(20182, 'Dendrite', 'n.', 'A stone or mineral on or in which are branching figures\n   resembling shrubs or trees, produced by a foreign mineral, usually an\n   oxide of manganese, as in the moss agate; also, a crystallized mineral\n   having an arborescent form, e. g., gold or silver; an arborization.'),
(20183, 'Dendroid', 'a.', 'Alt. of Dendroidal'),
(20184, 'Denegate', 'v. t.', 'To deny.'),
(20185, 'Dengue', 'n.', 'A specific epidemic disease attended with high fever,\n   cutaneous eruption, and severe pains in the head and limbs, resembling\n   those of rheumatism; -- called also breakbone fever. It occurs in\n   India, Egypt, the West Indies, etc., is of short duration, and rarely\n   fatal.'),
(20186, 'Deniable', 'a.', 'Capable of being, or liable to be, denied.'),
(20187, 'Denial', 'n.', 'The act of gainsaying, refusing, or disowning; negation; --\n   the contrary of affirmation.'),
(20188, 'Denial', 'n.', 'A refusal to admit the truth of a statement, charge,\n   imputation, etc.; assertion of the untruth of a thing stated or\n   maintained; a contradiction.'),
(20189, 'Denial', 'n.', 'A refusal to grant; rejection of a request.'),
(20190, 'Denial', 'n.', 'A refusal to acknowledge; disclaimer of connection with;\n   disavowal; -- the contrary of confession; as, the denial of a fault\n   charged on one; a denial of God.'),
(20191, 'Deniance', 'n.', 'Denial.'),
(20192, 'Denier', 'n.', 'One who denies; as, a denier of a fact, or of the faith, or\n   of Christ.'),
(20193, 'Denier', 'n.', 'A small copper coin of insignificant value.'),
(20194, 'Denim', 'n.', 'A coarse cotton drilling used for overalls, etc.'),
(20195, 'Denize', 'v. t.', 'To make a denizen; to confer the rights of citizenship\n   upon; to naturalize.'),
(20196, 'Denizen', 'n.', 'A dweller; an inhabitant.'),
(20197, 'Denizen', 'n.', 'One who is admitted by favor to all or a part of the\n   rights of citizenship, where he did not possess them by birth; an\n   adopted or naturalized citizen.'),
(20198, 'Denizen', 'n.', 'One admitted to residence in a foreign country.'),
(20199, 'Denizen', 'v. t.', 'To constitute (one) a denizen; to admit to residence,\n   with certain rights and privileges.'),
(20200, 'Denizen', 'v. t.', 'To provide with denizens; to populate with adopted or\n   naturalized occupants.'),
(20201, 'Dennet', 'n.', 'A light, open, two-wheeled carriage for one horse; a kind\n   of gig.'),
(20202, 'Denotate', 'v. t.', 'To mark off; to denote.'),
(20203, 'Denoted', 'imp. & p. p.', 'of Denote'),
(20204, 'Denoting', 'p. pr. & vb. n.', 'of Denote'),
(20205, 'Denote', 'v. t.', 'To mark out plainly; to signify by a visible sign; to\n   serve as the sign or name of; to indicate; to point out; as, the hands\n   of the clock denote the hour.'),
(20206, 'Denote', 'v. t.', 'To be the sign of; to betoken; to signify; to mean.'),
(20207, 'Denotive', 'a.', 'Serving to denote.'),
(20208, 'Denounce', 'v. t.', 'To make known in a solemn or official manner; to\n   declare; to proclaim (especially an evil).'),
(20209, 'Denounce', 'v. t.', 'To proclaim in a threatening manner; to threaten by\n   some outward sign or expression.'),
(20210, 'Denounce', 'v. t.', 'To point out as deserving of reprehension or\n   punishment, etc.; to accuse in a threatening manner; to invoke censure\n   upon; to stigmatize.'),
(20211, 'Dense', 'a.', 'Having the constituent parts massed or crowded together;\n   close; compact; thick; containing much matter in a small space; heavy;\n   opaque; as, a dense crowd; a dense forest; a dense fog.'),
(20212, 'Dense', 'a.', 'Stupid; gross; crass; as, dense ignorance.'),
(20213, 'Densely', 'adv.', 'In a dense, compact manner.'),
(20214, 'Density', 'n.', 'The quality of being dense, close, or thick; compactness;\n   -- opposed to rarity.'),
(20215, 'Density', 'n.', 'The ratio of mass, or quantity of matter, to bulk or\n   volume, esp. as compared with the mass and volume of a portion of some\n   substance used as a standard.'),
(20216, 'Density', 'n.', 'Depth of shade.'),
(20217, 'Dented', 'imp. & p. p.', 'of Dent'),
(20218, 'Denting', 'p. pr. & vb. n.', 'of Dent'),
(20219, 'Dental', 'a.', 'Of or pertaining to the teeth or to dentistry; as, dental\n   surgery.'),
(20220, 'Dental', 'a.', 'Formed by the aid of the teeth; -- said of certain\n   articulations and the letters representing them; as, d t are dental\n   letters.'),
(20221, 'Dental', 'a.', 'An articulation or letter formed by the aid of the teeth.'),
(20222, 'Dental', 'a.', 'A marine mollusk of the genus Dentalium, with a curved\n   conical shell resembling a tooth. See Dentalium.'),
(20223, 'Dentary', 'a.', 'Pertaining to, or bearing, teeth.'),
(20224, 'Dentary', 'n.', 'The distal bone of the lower jaw in many animals, which\n   may or may not bear teeth.'),
(20225, 'Dentate', 'a.', 'Alt. of Dentated'),
(20226, 'Dentated', 'a.', 'Toothed; especially, with the teeth projecting straight\n   out, not pointed either forward or backward; as, a dentate leaf.'),
(20227, 'Dentated', 'a.', 'Having teeth or toothlike points. See Illust. of\n   Antennae.'),
(20228, 'Dented', 'v. t.', 'Indented; impressed with little hollows.'),
(20229, 'Dentel', 'n.', 'Same as Dentil.'),
(20230, 'Dentelle', 'n.', 'An ornamental tooling like lace.'),
(20231, 'Dentelli', 'n. pl.', 'Modillions.'),
(20232, 'Dentex', 'n.', 'An edible European marine fish (Sparus dentex, or Dentex\n   vulgaris) of the family Percidae.'),
(20233, 'Denticle', 'n.', 'A small tooth or projecting point.'),
(20234, 'Dentil', 'n.', 'A small square block or projection in cornices, a number of\n   which are ranged in an ornamental band; -- used particularly in the\n   Ionic, Corinthian, and Composite orders.'),
(20235, 'Dentile', 'n.', 'A small tooth, like that of a saw.'),
(20236, 'Dential', 'a.', 'Of or pertaining to dentine.'),
(20237, 'Dentine', 'n.', 'The dense calcified substance of which teeth are largely\n   composed. It contains less animal matter than bone, and in the teeth of\n   man is situated beneath the enamel.'),
(20238, 'Dentist', 'n.', 'One whose business it is to clean, extract, or repair\n   natural teeth, and to make and insert artificial ones; a dental\n   surgeon.'),
(20239, 'Dentized', 'imp. & p. p.', 'of Dentize'),
(20240, 'Dentize', 'v. t. & i.', 'To breed or cut new teeth.'),
(20241, 'Dentoid', 'a.', 'Shaped like a tooth; tooth-shaped.'),
(20242, 'Denture', 'n.', 'An artificial tooth, block, or set of teeth.'),
(20243, 'Denudate', 'v. t.', 'To denude.'),
(20244, 'Denude', 'v. t.', 'To divest of all covering; to make bare or naked; to\n   strip; to divest; as, to denude one of clothing, or lands.'),
(20245, 'Denied', 'imp. & p. p.', 'of Deny'),
(20246, 'Denying', 'p. pr. & vb. n.', 'of Deny'),
(20247, 'Deodand', 'n.', 'A personal chattel which had caused the death of a person,\n   and for that reason was given to God, that is, forfeited to the crown,\n   to be applied to pious uses, and distributed in alms by the high\n   almoner. Thus, if a cart ran over a man and killed him, it was\n   forfeited as a deodand.'),
(20248, 'Deodar', 'n.', 'A kind of cedar (Cedrus Deodara), growing in India, highly\n   valued for its size and beauty as well as for its timber, and also\n   grown in England as an ornamental tree.'),
(20249, 'Deodate', 'n.', 'A gift or offering to God.'),
(20250, 'Depaint', 'p. p.', 'Painted.'),
(20251, 'Depaint', 'v. t.', 'To paint; to picture; hence, to describe; to delineate\n   in words; to depict.'),
(20252, 'Depaint', 'v. t.', 'To mark with, or as with, color; to color.'),
(20253, 'Departed', 'imp. & p. p.', 'of Depart'),
(20254, 'Depart', 'v. i.', 'To part; to divide; to separate.'),
(20255, 'Depart', 'v. i.', 'To go forth or away; to quit, leave, or separate, as\n   from a place or a person; to withdraw; -- opposed to arrive; -- often\n   with from before the place, person, or thing left, and for or to before\n   the destination.'),
(20256, 'Depart', 'v. i.', 'To forsake; to abandon; to desist or deviate (from); not\n   to adhere to; -- with from; as, we can not depart from our rules; to\n   depart from a title or defense in legal pleading.'),
(20257, 'Depart', 'v. i.', 'To pass away; to perish.'),
(20258, 'Depart', 'v. i.', 'To quit this world; to die.'),
(20259, 'Depart', 'v. t.', 'To part thoroughly; to dispart; to divide; to separate.'),
(20260, 'Depart', 'v. t.', 'To divide in order to share; to apportion.'),
(20261, 'Depart', 'v. t.', 'To leave; to depart from.'),
(20262, 'Depart', 'n.', 'Division; separation, as of compound substances into their\n   ingredients.'),
(20263, 'Depart', 'n.', 'A going away; departure; hence, death.'),
(20264, 'Departer', 'n.', 'One who refines metals by separation.'),
(20265, 'Departer', 'n.', 'One who departs.'),
(20266, 'Depeach', 'v. t.', 'To discharge.'),
(20267, 'Depeinct', 'v. t.', 'To paint.'),
(20268, 'Depended', 'imp. & p. p.', 'of Depend'),
(20269, 'Depend', 'v. i.', 'To hang down; to be sustained by being fastened or\n   attached to something above.'),
(20270, 'Depend', 'v. i.', 'To hang in suspense; to be pending; to be undetermined\n   or undecided; as, a cause depending in court.'),
(20271, 'Depend', 'v. i.', 'To rely for support; to be conditioned or contingent; to\n   be connected with anything, as a cause of existence, or as a necessary\n   condition; -- followed by on or upon, formerly by of.'),
(20272, 'Depend', 'v. i.', 'To trust; to rest with confidence; to rely; to confide;\n   to be certain; -- with on or upon; as, we depend on the word or\n   assurance of our friends; we depend on the mail at the usual hour.'),
(20273, 'Depend', 'v. i.', 'To serve; to attend; to act as a dependent or retainer.'),
(20274, 'Depend', 'v. i.', 'To impend.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(20275, 'Depender', 'n.', 'One who depends; a dependent.'),
(20276, 'Depeople', 'v. t.', 'To depopulate.'),
(20277, 'Deperdit', 'n.', 'That which is lost or destroyed.'),
(20278, 'Dephlegm', 'v. t.', 'To rid of phlegm or water; to dephlegmate.'),
(20279, 'Depict', 'p. p.', 'Depicted.'),
(20280, 'Depict', 'p. p.', 'Depicted.'),
(20281, 'Depicted', 'imp. & p. p.', 'of Depict'),
(20282, 'Depict', 'v. t.', 'To form a colored likeness of; to represent by a\n   picture; to paint; to portray.'),
(20283, 'Depict', 'v. t.', 'To represent in words; to describe vividly.'),
(20284, 'Depilate', 'v. t.', 'To strip of hair; to husk.'),
(20285, 'Depilous', 'a.', 'Hairless.'),
(20286, 'Deplant', 'v. t.', 'To take up (plants); to transplant.'),
(20287, 'Depleted', 'imp. & p. p.', 'of Deplete'),
(20288, 'Deplete', 'a.', 'To empty or unload, as the vessels of human system, by\n   bloodletting or by medicine.'),
(20289, 'Deplete', 'a.', 'To reduce by destroying or consuming the vital powers of;\n   to exhaust, as a country of its strength or resources, a treasury of\n   money, etc.'),
(20290, 'Deplored', 'imp. & p. p.', 'of Deplore'),
(20291, 'Deplore', 'v. t.', 'To feel or to express deep and poignant grief for; to\n   bewail; to lament; to mourn; to sorrow over.'),
(20292, 'Deplore', 'v. t.', 'To complain of.'),
(20293, 'Deplore', 'v. t.', 'To regard as hopeless; to give up.'),
(20294, 'Deplore', 'v. i.', 'To lament.'),
(20295, 'Deplorre', 'n.', 'One who deplores.'),
(20296, 'Deployed', 'imp. & p. p.', 'of Deploy'),
(20297, 'Deploy', 'v. t. & i.', 'To open out; to unfold; to spread out (a body of\n   troops) in such a way that they shall display a wider front and less\n   depth; -- the reverse of ploy; as, to deploy a column of troops into\n   line of battle.'),
(20298, 'Deploy', 'n.', 'Alt. of Deployment'),
(20299, 'Deplumed', 'imp. & p. p.', 'of Deplume'),
(20300, 'Deplume', 'v. t.', 'To strip or pluck off the feather of; to deprive of of\n   plumage.'),
(20301, 'Deplume', 'v. t.', 'To lay bare; to expose.'),
(20302, 'Depolish', 'v. t.', 'To remove the polish or glaze from.'),
(20303, 'Deponed', 'imp. & p. p.', 'of Depone'),
(20304, 'Deponing', 'p. pr. & vb. n.', 'of Depone'),
(20305, 'Depone', 'v. t.', 'To lay, as a stake; to wager.'),
(20306, 'Depone', 'v. t.', 'To lay down.'),
(20307, 'Depone', 'v. t.', 'To assert under oath; to depose.'),
(20308, 'Depone', 'v. i.', 'To testify under oath; to depose; to bear witness.'),
(20309, 'Deponent', 'v. t.', 'One who deposes or testifies under oath; one who gives\n   evidence; usually, one who testifies in writing.'),
(20310, 'Deponent', 'v. t.', 'A deponent verb.'),
(20311, 'Deponent', 'a.', 'Having a passive form with an active meaning, as certain\n   latin and Greek verbs.'),
(20312, 'Deported', 'imp. & p. p.', 'of Deport'),
(20313, 'Deport', 'v. t.', 'To transport; to carry away; to exile; to send into\n   banishment.'),
(20314, 'Deport', 'v. t.', 'To carry or demean; to conduct; to behave; -- followed\n   by the reflexive pronoun.'),
(20315, 'Deport', 'n.', 'Behavior; carriage; demeanor; deportment.'),
(20316, 'Deposal', 'n.', 'The act of deposing from office; a removal from the\n   throne.'),
(20317, 'Deposed', 'imp. & p. p.', 'of Depose'),
(20318, 'Deposing', 'p. pr. & vb. n.', 'of Depose'),
(20319, 'Depose', 'v. t.', 'To lay down; to divest one\'s self of; to lay aside.'),
(20320, 'Depose', 'v. t.', 'To let fall; to deposit.'),
(20321, 'Depose', 'v. t.', 'To remove from a throne or other high station; to\n   dethrone; to divest or deprive of office.'),
(20322, 'Depose', 'v. t.', 'To testify under oath; to bear testimony to; -- now\n   usually said of bearing testimony which is officially written down for\n   future use.'),
(20323, 'Depose', 'v. t.', 'To put under oath.'),
(20324, 'Depose', 'v. i.', 'To bear witness; to testify under oath; to make\n   deposition.'),
(20325, 'Deposer', 'n.', 'One who deposes or degrades from office.'),
(20326, 'Deposer', 'n.', 'One who testifies or deposes; a deponent.'),
(20327, 'Deposit', 'n.', 'To lay down; to place; to put; to let fall or throw down\n   (as sediment); as, a crocodile deposits her eggs in the sand; the\n   waters deposited a rich alluvium.'),
(20328, 'Deposit', 'n.', 'To lay up or away for safe keeping; to put up; to store;\n   as, to deposit goods in a warehouse.'),
(20329, 'Deposit', 'n.', 'To lodge in some one\'s hands for safe keeping; to commit\n   to the custody of another; to intrust; esp., to place in a bank, as a\n   sum of money subject to order.'),
(20330, 'Deposit', 'n.', 'To lay aside; to rid one\'s self of.'),
(20331, 'Deposit', 'v. t.', 'That which is deposited, or laid or thrown down; as, a\n   deposit in a flue; especially, matter precipitated from a solution (as\n   the siliceous deposits of hot springs), or that which is mechanically\n   deposited (as the mud, gravel, etc., deposits of a river).'),
(20332, 'Deposit', 'v. t.', 'A natural occurrence of a useful mineral under the\n   conditions to invite exploitation.'),
(20333, 'Deposit', 'v. t.', 'That which is placed anywhere, or in any one\'s hands,\n   for safe keeping; something intrusted to the care of another; esp.,\n   money lodged with a bank or banker, subject to order; anything given as\n   pledge or security.'),
(20334, 'Deposit', 'v. t.', 'A bailment of money or goods to be kept gratuitously\n   for the bailor.'),
(20335, 'Deposit', 'v. t.', 'Money lodged with a party as earnest or security for\n   the performance of a duty assumed by the person depositing.'),
(20336, 'Deposit', 'v. t.', 'A place of deposit; a depository.'),
(20337, 'Depot', 'n.', 'A place of deposit for the storing of goods; a warehouse; a\n   storehouse.'),
(20338, 'Depot', 'n.', 'A military station where stores and provisions are kept, or\n   where recruits are assembled and drilled.'),
(20339, 'Depot', 'n.', 'The headquarters of a regiment, where all supplies are\n   received and distributed, recruits are assembled and instructed, infirm\n   or disabled soldiers are taken care of, and all the wants of the\n   regiment are provided for.'),
(20340, 'Depot', 'n.', 'A railway station; a building for the accommodation and\n   protection of railway passengers or freight.'),
(20341, 'Depper', 'a.', 'Deeper.'),
(20342, 'Depraved', 'imp. & p. p.', 'of Deprave'),
(20343, 'Deprave', 'n. t.', 'To speak ill of; to depreciate; to malign; to revile.'),
(20344, 'Deprave', 'n. t.', 'To make bad or worse; to vitiate; to corrupt.'),
(20345, 'Depraver', 'n.', 'One who deprave or corrupts.'),
(20346, 'Depress', 'v. t.', 'To press down; to cause to sink; to let fall; to lower;\n   as, to depress the muzzle of a gun; to depress the eyes.'),
(20347, 'Depress', 'v. t.', 'To bring down or humble; to abase, as pride.'),
(20348, 'Depress', 'v. t.', 'To cast a gloom upon; to sadden; as, his spirits were\n   depressed.'),
(20349, 'Depress', 'v. t.', 'To lessen the activity of; to make dull; embarrass, as\n   trade, commerce, etc.'),
(20350, 'Depress', 'v. t.', 'To lessen in price; to cause to decline in value; to\n   cheapen; to depreciate.'),
(20351, 'Depress', 'v. t.', 'To reduce (an equation) in a lower degree.'),
(20352, 'Depress', 'a.', 'Having the middle lower than the border; concave.'),
(20353, 'Deprived', 'imp. & p. p.', 'of Deprive'),
(20354, 'Deprive', 'v. t.', 'To take away; to put an end; to destroy.'),
(20355, 'Deprive', 'v. t.', 'To dispossess; to bereave; to divest; to hinder from\n   possessing; to debar; to shut out from; -- with a remoter object,\n   usually preceded by of.'),
(20356, 'Deprive', 'v. t.', 'To divest of office; to depose; to dispossess of\n   dignity, especially ecclesiastical.'),
(20357, 'Depriver', 'n.', 'One who, or that which, deprives.'),
(20358, 'Depth', 'n.', 'The quality of being deep; deepness; perpendicular\n   measurement downward from the surface, or horizontal measurement\n   backward from the front; as, the depth of a river; the depth of a body\n   of troops.'),
(20359, 'Depth', 'n.', 'Profoundness; extent or degree of intensity; abundance;\n   completeness; as, depth of knowledge, or color.'),
(20360, 'Depth', 'n.', 'Lowness; as, depth of sound.'),
(20361, 'Depth', 'n.', 'That which is deep; a deep, or the deepest, part or place;\n   the deep; the middle part; as, the depth of night, or of winter.'),
(20362, 'Depth', 'n.', 'The number of simple elements which an abstract conception\n   or notion includes; the comprehension or content.'),
(20363, 'Depth', 'n.', 'A pair of toothed wheels which work together.'),
(20364, 'Depthen', 'v. t.', 'To deepen.'),
(20365, 'Depulse', 'v. t.', 'To drive away.'),
(20366, 'Depurant', 'a. & n.', 'Depurative.'),
(20367, 'Depurate', 'a.', 'Depurated; cleansed; freed from impurities.'),
(20368, 'Depurate', 'v. t.', 'To free from impurities, heterogeneous matter, or\n   feculence; to purify; to cleanse.'),
(20369, 'Depure', 'v. t.', 'To depurate; to purify.'),
(20370, 'Deputed', 'imp. & p. p.', 'of Depute'),
(20371, 'Deputing', 'p. pr. & vb. n.', 'of Depute'),
(20372, 'Depute', 'v. t.', 'To appoint as deputy or agent; to commission to act in\n   one\'s place; to delegate.'),
(20373, 'Depute', 'v. t.', 'To appoint; to assign; to choose.'),
(20374, 'Depute', 'n.', 'A person deputed; a deputy.'),
(20375, 'Deputize', 'v. t.', 'To appoint as one\'s deputy; to empower to act in one\'s\n   stead; to depute.'),
(20376, 'Deputies', 'pl. ', 'of Deputy'),
(20377, 'Deputy', 'n.', 'One appointed as the substitute of another, and empowered\n   to act for him, in his name or his behalf; a substitute in office; a\n   lieutenant; a representative; a delegate; a vicegerent; as, the deputy\n   of a prince, of a sheriff, of a township, etc.'),
(20378, 'Deputy', 'n.', 'A member of the Chamber of Deputies.'),
(20379, 'Deraign', 'v. t.', 'Alt. of Derain'),
(20380, 'Derain', 'v. t.', 'To prove or to refute by proof; to clear (one\'s self).'),
(20381, 'Derailed', 'imp. & p. p.', 'of Derail'),
(20382, 'Derail', 'v. t.', 'To cause to run off from the rails of a railroad, as a\n   locomotive.'),
(20383, 'Deranged', 'imp. & p. p.', 'of Derange'),
(20384, 'Derange', 'v. t.', 'To put out of place, order, or rank; to disturb the\n   proper arrangement or order of; to throw into disorder, confusion, or\n   embarrassment; to disorder; to disarrange; as, to derange the plans of\n   a commander, or the affairs of a nation.'),
(20385, 'Derange', 'v. t.', 'To disturb in action or function, as a part or organ,\n   or the whole of a machine or organism.'),
(20386, 'Derange', 'v. t.', 'To disturb in the orderly or normal action of the\n   intellect; to render insane.'),
(20387, 'Deranged', 'a.', 'Disordered; especially, disordered in mind; crazy;\n   insane.'),
(20388, 'Deranger', 'n.', 'One who deranges.'),
(20389, 'Deray', 'n.', 'Disorder; merriment.'),
(20390, 'Derbio', 'n.', 'A large European food fish (Lichia glauca).'),
(20391, 'Derby', 'n.', 'A race for three-old horses, run annually at Epsom (near\n   London), for the Derby stakes. It was instituted by the 12th Earl of\n   Derby, in 1780.'),
(20392, 'Derby', 'n.', 'A stiff felt hat with a dome-shaped crown.'),
(20393, 'Derdoing', 'v. t.', 'Doing daring or chivalrous deeds.'),
(20394, 'Dereine', 'v. t.', 'Alt. of Dereyne'),
(20395, 'Dereyne', 'v. t.', 'Same as Darraign.'),
(20396, 'Derelict', 'a.', 'Given up or forsaken by the natural owner or guardian;\n   left and abandoned; as, derelict lands.'),
(20397, 'Derelict', 'a.', 'Lost; adrift; hence, wanting; careless; neglectful;\n   unfaithful.'),
(20398, 'Derelict', 'n.', 'A thing voluntary abandoned or willfully cast away by its\n   proper owner, especially a ship abandoned at sea.'),
(20399, 'Derelict', 'n.', 'A tract of land left dry by the sea, and fit for\n   cultivation or use.'),
(20400, 'Dereling', 'n.', 'Darling.'),
(20401, 'Dereling', 'n.', 'Darling.'),
(20402, 'Derided', 'imp. & p. p.', 'of Deride'),
(20403, 'Deriding', 'p. pr. & vb. n.', 'of Deride'),
(20404, 'Deride', 'v. t.', 'To laugh at with contempt; to laugh to scorn; to turn to\n   ridicule or make sport of; to mock; to scoff at.'),
(20405, 'Derider', 'n.', 'One who derides, or laughs at, another in contempt; a\n   mocker; a scoffer.'),
(20406, 'Derision', 'n.', 'The act of deriding, or the state of being derided;\n   mockery; scornful or contemptuous treatment which holds one up to\n   ridicule.'),
(20407, 'Derision', 'n.', 'An object of derision or scorn; a laughing-stock.'),
(20408, 'Derisive', 'a.', 'Expressing, serving for, or characterized by, derision.'),
(20409, 'Derisory', 'a.', 'Derisive; mocking.'),
(20410, 'Derival', 'n.', 'Derivation.'),
(20411, 'Derivate', 'a.', 'Derived; derivative.'),
(20412, 'Derivate', 'n.', 'A thing derived; a derivative.'),
(20413, 'Derivate', 'v. t.', 'To derive.'),
(20414, 'Derived', 'imp. & p. p.', 'of Derive'),
(20415, 'Deriving', 'p. pr. & vb. n.', 'of Derive'),
(20416, 'Derive', 'v. t.', 'To turn the course of, as water; to divert and\n   distribute into subordinate channels; to diffuse; to communicate; to\n   transmit; -- followed by to, into, on, upon.'),
(20417, 'Derive', 'v. t.', 'To receive, as from a source or origin; to obtain by\n   descent or by transmission; to draw; to deduce; -- followed by from.'),
(20418, 'Derive', 'v. t.', 'To trace the origin, descent, or derivation of; to\n   recognize transmission of; as, he derives this word from the\n   Anglo-Saxon.'),
(20419, 'Derive', 'v. t.', 'To obtain one substance from another by actual or\n   theoretical substitution; as, to derive an organic acid from its\n   corresponding hydrocarbon.'),
(20420, 'Derive', 'v. i.', 'To flow; to have origin; to descend; to proceed; to be\n   deduced.'),
(20421, 'Deriver', 'n.', 'One who derives.'),
(20422, '-derm', 'n.', 'A suffix or terminal formative, much used in anatomical\n   terms, and signifying skin, integument, covering; as, blastoderm,\n   ectoderm, etc.'),
(20423, 'Derma', 'n.', 'See Dermis.'),
(20424, 'Dermal', 'a.', 'Pertaining to the integument or skin of animals; dermic;\n   as, the dermal secretions.'),
(20425, 'Dermal', 'a.', 'Pertaining to the dermis or true skin.'),
(20426, 'Dermatic', 'a.', 'Alt. of Dermatine'),
(20427, 'Dermic', 'a.', 'Relating to the derm or skin.'),
(20428, 'Dermic', 'a.', 'Pertaining to the dermis; dermal.'),
(20429, 'Dermis', 'n.', 'The deep sensitive layer of the skin beneath the scarfskin\n   or epidermis; -- called also true skin, derm, derma, corium, cutis, and\n   enderon. See Skin, and Illust. in Appendix.'),
(20430, 'Dermoid', 'a.', 'Same as Dermatoid.'),
(20431, 'Derne', 'a.', 'To hide; to skulk.'),
(20432, 'Dernful', 'a.', 'Secret; hence, lonely; sad; mournful.'),
(20433, 'Dernier', 'a.', 'Last; final.'),
(20434, 'Dernly', 'adv.', 'Secretly; grievously; mournfully.'),
(20435, 'Derogant', 'a.', 'Derogatory.'),
(20436, 'Derogate', 'v. t.', 'To annul in part; to repeal partly; to restrict; to\n   limit the action of; -- said of a law.'),
(20437, 'Derogate', 'v. t.', 'To lessen; to detract from; to disparage; to\n   depreciate; -- said of a person or thing.'),
(20438, 'Derogate', 'v. i.', 'To take away; to detract; to withdraw; -- usually with\n   from.'),
(20439, 'Derogate', 'v. i.', 'To act beneath one-s rank, place, birth, or character;\n   to degenerate.'),
(20440, 'Derogate', 'n.', 'Diminished in value; dishonored; degraded.'),
(20441, 'Derre', 'a.', 'Dearer.'),
(20442, 'Derrick', 'n.', 'A mast, spar, or tall frame, supported at the top by stays\n   or guys, with suitable tackle for hoisting heavy weights, as stones in\n   building.'),
(20443, 'Derring', 'a.', 'Daring or warlike.'),
(20444, 'Derth', 'n.', 'Dearth; scarcity.'),
(20445, 'Dervish', 'n.', 'Alt. of Dervis'),
(20446, 'Dervise', 'n.', 'Alt. of Dervis'),
(20447, 'Dervis', 'n.', 'A Turkish or Persian monk, especially one who professes\n   extreme poverty and leads an austere life.'),
(20448, 'Derworth', 'a.', 'Precious.'),
(20449, 'Descant', 'v. i.', 'Originally, a double song; a melody or counterpoint\n   sung above the plain song of the tenor; a variation of an air; a\n   variation by ornament of the main subject or plain song.'),
(20450, 'Descant', 'v. i.', 'The upper voice in part music.'),
(20451, 'Descant', 'v. i.', 'The canto, cantus, or soprano voice; the treble.'),
(20452, 'Descant', 'v. i.', 'A discourse formed on its theme, like variations on a\n   musical air; a comment or comments.'),
(20453, 'Descant', 'v. i.', 'To sing a variation or accomplishment.'),
(20454, 'Descant', 'v. i.', 'To comment freely; to discourse with fullness and\n   particularity; to discourse at large.'),
(20455, 'Descend', 'v. i.', 'To pass from a higher to a lower place; to move\n   downwards; to come or go down in any way, as by falling, flowing,\n   walking, etc.; to plunge; to fall; to incline downward; -- the opposite\n   of ascend.'),
(20456, 'Descend', 'v. i.', 'To enter mentally; to retire.'),
(20457, 'Descend', 'v. i.', 'To make an attack, or incursion, as if from a vantage\n   ground; to come suddenly and with violence; -- with on or upon.'),
(20458, 'Descend', 'v. i.', 'To come down to a lower, less fortunate, humbler, less\n   virtuous, or worse, state or station; to lower or abase one\'s self; as,\n   he descended from his high estate.'),
(20459, 'Descend', 'v. i.', 'To pass from the more general or important to the\n   particular or less important matters to be considered.'),
(20460, 'Descend', 'v. i.', 'To come down, as from a source, original, or stock; to\n   be derived; to proceed by generation or by transmission; to fall or\n   pass by inheritance; as, the beggar may descend from a prince; a crown\n   descends to the heir.'),
(20461, 'Descend', 'v. i.', 'To move toward the south, or to the southward.'),
(20462, 'Descend', 'v. i.', 'To fall in pitch; to pass from a higher to a lower\n   tone.'),
(20463, 'Descend', 'v. t.', 'To go down upon or along; to pass from a higher to a\n   lower part of; as, they descended the river in boats; to descend a\n   ladder.'),
(20464, 'Descent', 'n.', 'The act of descending, or passing downward; change of\n   place from higher to lower.'),
(20465, 'Descent', 'n.', 'Incursion; sudden attack; especially, hostile invasion\n   from sea; -- often followed by upon or on; as, to make a descent upon\n   the enemy.'),
(20466, 'Descent', 'n.', 'Progress downward, as in station, virtue, as in station,\n   virtue, and the like, from a higher to a lower state, from a higher to\n   a lower state, from the more to the less important, from the better to\n   the worse, etc.'),
(20467, 'Descent', 'n.', 'Derivation, as from an ancestor; procedure by generation;\n   lineage; birth; extraction.'),
(20468, 'Descent', 'n.', 'Transmission of an estate by inheritance, usually, but not\n   necessarily, in the descending line; title to inherit an estate by\n   reason of consanguinity.'),
(20469, 'Descent', 'n.', 'Inclination downward; a descending way; inclined or\n   sloping surface; declivity; slope; as, a steep descent.'),
(20470, 'Descent', 'n.', 'That which is descended; descendants; issue.'),
(20471, 'Descent', 'n.', 'A step or remove downward in any scale of gradation; a\n   degree in the scale of genealogy; a generation.'),
(20472, 'Descent', 'n.', 'Lowest place; extreme downward place.'),
(20473, 'Descent', 'n.', 'A passing from a higher to a lower tone.'),
(20474, 'Describe', 'v. t.', 'To represent by drawing; to draw a plan of; to\n   delineate; to trace or mark out; as, to describe a circle by the\n   compasses; a torch waved about the head in such a way as to describe a\n   circle.'),
(20475, 'Describe', 'v. t.', 'To represent by words written or spoken; to give an\n   account of; to make known to others by words or signs; as, the\n   geographer describes countries and cities.'),
(20476, 'Describe', 'v. t.', 'To distribute into parts, groups, or classes; to mark\n   off; to class.'),
(20477, 'Describe', 'v. i.', 'To use the faculty of describing; to give a\n   description; as, Milton describes with uncommon force and beauty.'),
(20478, 'Descrier', 'n.', 'One who descries.'),
(20479, 'Descrive', 'v. t.', 'To describe.'),
(20480, 'Descried', 'imp. & p. p.', 'of Descry'),
(20481, 'Descry', 'v. t.', 'To spy out or discover by the eye, as objects distant or\n   obscure; to espy; to recognize; to discern; to discover.'),
(20482, 'Descry', 'v. t.', 'To discover; to disclose; to reveal.'),
(20483, 'Descry', 'n.', 'Discovery or view, as of an army seen at a distance.'),
(20484, 'Desecate', 'v. t.', 'To cut, as with a scythe; to mow.'),
(20485, 'Desert', 'n.', 'That which is deserved; the reward or the punishment justly\n   due; claim to recompense, usually in a good sense; right to reward;\n   merit.'),
(20486, 'Desert', 'n.', 'A deserted or forsaken region; a barren tract incapable of\n   supporting population, as the vast sand plains of Asia and Africa are\n   destitute and vegetation.'),
(20487, 'Desert', 'n.', 'A tract, which may be capable of sustaining a population,\n   but has been left unoccupied and uncultivated; a wilderness; a solitary\n   place.'),
(20488, 'Desert', 'a.', 'Of or pertaining to a desert; forsaken; without life or\n   cultivation; unproductive; waste; barren; wild; desolate; solitary; as,\n   they landed on a desert island.'),
(20489, 'Deserted', 'imp. & p. p.', 'of Desert'),
(20490, 'Desert', 'v. t.', 'To leave (especially something which one should stay by\n   and support); to leave in the lurch; to abandon; to forsake; --\n   implying blame, except sometimes when used of localities; as, to desert\n   a friend, a principle, a cause, one\'s country.'),
(20491, 'Desert', 'v. t.', 'To abandon (the service) without leave; to forsake in\n   violation of duty; to abscond from; as, to desert the army; to desert\n   one\'s colors.'),
(20492, 'Desert', 'v. i.', 'To abandon a service without leave; to quit military\n   service without permission, before the expiration of one\'s term; to\n   abscond.'),
(20493, 'Deserter', 'n.', 'One who forsakes a duty, a cause or a party, a friend, or\n   any one to whom he owes service; especially, a soldier or a seaman who\n   abandons the service without leave; one guilty of desertion.'),
(20494, 'Deserved', 'imp. & p. p.', 'of Deserve'),
(20495, 'Deserve', 'v. t.', 'To earn by service; to be worthy of (something due,\n   either good or evil); to merit; to be entitled to; as, the laborer\n   deserves his wages; a work of value deserves praise.'),
(20496, 'Deserve', 'v. t.', 'To serve; to treat; to benefit.'),
(20497, 'Deserve', 'v. i.', 'To be worthy of recompense; -- usually with ill or with\n   well.'),
(20498, 'Deserver', 'n.', 'One who deserves.'),
(20499, 'Desight', 'n.', 'An unsightly object.'),
(20500, 'Designed', 'imp. & p. p.', 'of Design'),
(20501, 'Design', 'n.', 'To draw preliminary outline or main features of; to sketch\n   for a pattern or model; to delineate; to trace out; to draw.'),
(20502, 'Design', 'n.', 'To mark out and exhibit; to designate; to indicate; to\n   show; to point out; to appoint.'),
(20503, 'Design', 'n.', 'To create or produce, as a work of art; to form a plan or\n   scheme of; to form in idea; to invent; to project; to lay out in the\n   mind; as, a man designs an essay, a poem, a statue, or a cathedral.'),
(20504, 'Design', 'n.', 'To intend or purpose; -- usually with for before the remote\n   object, but sometimes with to.'),
(20505, 'Design', 'v. i.', 'To form a design or designs; to plan.'),
(20506, 'Design', 'n.', 'A preliminary sketch; an outline or pattern of the main\n   features of something to be executed, as of a picture, a building, or a\n   decoration; a delineation; a plan.'),
(20507, 'Design', 'n.', 'A plan or scheme formed in the mind of something to be\n   done; preliminary conception; idea intended to be expressed in a\n   visible form or carried into action; intention; purpose; -- often used\n   in a bad sense for evil intention or purpose; scheme; plot.'),
(20508, 'Design', 'n.', 'Specifically, intention or purpose as revealed or inferred\n   from the adaptation of means to an end; as, the argument from design.'),
(20509, 'Design', 'n.', 'The realization of an inventive or decorative plan; esp., a\n   work of decorative art considered as a new creation; conception or plan\n   shown in completed work; as, this carved panel is a fine design, or of\n   a fine design.'),
(20510, 'Design', 'n.', 'The invention and conduct of the subject; the disposition\n   of every part, and the general order of the whole.'),
(20511, 'Designer', 'n.', 'One who designs, marks out, or plans; a contriver.'),
(20512, 'Designer', 'n.', 'One who produces or creates original works of art or\n   decoration.'),
(20513, 'Designer', 'n.', 'A plotter; a schemer; -- used in a bad sense.'),
(20514, 'Desilver', 'v. t.', 'To deprive of silver; as, to desilver lead.'),
(20515, 'Desinent', 'a.', 'Ending; forming an end; lowermost.'),
(20516, 'Desired', 'imp. & p. p.', 'of Desire'),
(20517, 'Desiring', 'p. pr. & vb. n.', 'of Desire'),
(20518, 'Desire', 'v. t.', 'To long for; to wish for earnestly; to covet.'),
(20519, 'Desire', 'v. t.', 'To express a wish for; to entreat; to request.'),
(20520, 'Desire', 'v. t.', 'To require; to demand; to claim.'),
(20521, 'Desire', 'v. t.', 'To miss; to regret.'),
(20522, 'Desire', 'v. t.', 'The natural longing that is excited by the enjoyment or\n   the thought of any good, and impels to action or effort its continuance\n   or possession; an eager wish to obtain or enjoy.'),
(20523, 'Desire', 'v. t.', 'An expressed wish; a request; petition.'),
(20524, 'Desire', 'v. t.', 'Anything which is desired; an object of longing.'),
(20525, 'Desire', 'v. t.', 'Excessive or morbid longing; lust; appetite.'),
(20526, 'Desire', 'v. t.', 'Grief; regret.'),
(20527, 'Desirer', 'n.', 'One who desires, asks, or wishes.'),
(20528, 'Desirous', 'n.', 'Feeling desire; eagerly wishing; solicitous; eager to\n   obtain; covetous.'),
(20529, 'Desisted', 'imp. & p. p.', 'of Desist'),
(20530, 'Desist', 'v. i.', 'To cease to proceed or act; to stop; to forbear; --\n   often with from.'),
(20531, 'Desition', 'n.', 'An end or ending.'),
(20532, 'Desitive', 'a.', 'Final; serving to complete; conclusive.'),
(20533, 'Desitive', 'n.', 'A proposition relating to or expressing an end or\n   conclusion.'),
(20534, 'Desked', 'imp. & p. p.', 'of Desk'),
(20535, 'Desking', 'p. pr. & vb. n.', 'of Desk'),
(20536, 'Deskwork', 'n.', 'Work done at a desk, as by a clerk or writer.'),
(20537, 'Desman', 'n.', 'An amphibious, insectivorous mammal found in Russia\n   (Myogale moschata). It is allied to the moles, but is called muskrat by\n   some English writers.'),
(20538, 'Desmid', 'n.', 'Alt. of Desmidian'),
(20539, 'Desmine', 'n.', 'Same as Stilbite. It commonly occurs in bundles or tufts\n   of crystals.'),
(20540, 'Desmoid', 'a.', 'Resembling, or having the characteristics of, a ligament;\n   ligamentous.'),
(20541, 'Desolate', 'a.', 'Destitute or deprived of inhabitants; deserted;\n   uninhabited; hence, gloomy; as, a desolate isle; a desolate wilderness;\n   a desolate house.'),
(20542, 'Desolate', 'a.', 'Laid waste; in a ruinous condition; neglected; destroyed;\n   as, desolate altars.'),
(20543, 'Desolate', 'a.', 'Left alone; forsaken; lonely; comfortless.'),
(20544, 'Desolate', 'a.', 'Lost to shame; dissolute.'),
(20545, 'Desolate', 'a.', 'Destitute of; lacking in.'),
(20546, 'Desolate', 'v. t.', 'To make desolate; to leave alone; to deprive of\n   inhabitants; as, the earth was nearly desolated by the flood.'),
(20547, 'Desolate', 'v. t.', 'To lay waste; to ruin; to ravage; as, a fire desolates\n   a city.'),
(20548, 'Despair', 'v. i.', 'To be hopeless; to have no hope; to give up all hope or\n   expectation; -- often with of.'),
(20549, 'Despair', 'v. t.', 'To give up as beyond hope or expectation; to despair\n   of.'),
(20550, 'Despair', 'v. t.', 'To cause to despair.'),
(20551, 'Despair', 'n.', 'Loss of hope; utter hopelessness; complete despondency.'),
(20552, 'Despair', 'n.', 'That which is despaired of.'),
(20553, 'Despatch', 'n. & v.', 'Same as Dispatch.'),
(20554, 'Despect', 'n.', 'Contempt.'),
(20555, 'Despeed', 'v. t.', 'To send hastily.'),
(20556, 'Despend', 'v. t.', 'To spend; to squander. See Dispend.'),
(20557, 'Despisal', 'n.', 'A despising; contempt.'),
(20558, 'Despised', 'imp. & p. p.', 'of Despise'),
(20559, 'Despise', 'v. t.', 'To look down upon with disfavor or contempt; to\n   contemn; to scorn; to disdain; to have a low opinion or contemptuous\n   dislike of.'),
(20560, 'Despiser', 'n.', 'One who despises; a contemner; a scorner.'),
(20561, 'Despite', 'n.', 'Malice; malignity; spite; malicious anger; contemptuous\n   hate.'),
(20562, 'Despite', 'n.', 'An act of malice, hatred, or defiance; contemptuous\n   defiance; a deed of contempt.'),
(20563, 'Despited', 'imp. & p. p.', 'of Despite'),
(20564, 'Despite', 'n.', 'To vex; to annoy; to offend contemptuously.'),
(20565, 'Despite', 'prep.', 'In spite of; against, or in defiance of;\n   notwithstanding; as, despite his prejudices.'),
(20566, 'Despoil', 'v. t.', 'To strip, as of clothing; to divest or unclothe.'),
(20567, 'Despoil', 'v. t.', 'To deprive for spoil; to plunder; to rob; to pillage;\n   to strip; to divest; -- usually followed by of.'),
(20568, 'Despoil', 'n.', 'Spoil.'),
(20569, 'Despond', 'v. i.', 'To give up, the will, courage, or spirit; to be\n   thoroughly disheartened; to lose all courage; to become dispirited or\n   depressed; to take an unhopeful view.'),
(20570, 'Despond', 'n.', 'Despondency.'),
(20571, 'Desport', 'v. t. & i.', 'See Disport.'),
(20572, 'Despot', 'n.', 'A master; a lord; especially, an absolute or irresponsible\n   ruler or sovereign.'),
(20573, 'Despot', 'n.', 'One who rules regardless of a constitution or laws; a\n   tyrant.'),
(20574, 'Despotat', 'n.', 'The station or government of a despot; also, the domain\n   of a despot.'),
(20575, 'Despotic', 'a.', 'Alt. of Despotical'),
(20576, 'Despread', 'v. t. & i.', 'See Dispread.'),
(20577, 'Despume', 'v. t.', 'To free from spume or scum.'),
(20578, 'Dessert', 'n.', 'A service of pastry, fruits, or sweetmeats, at the close\n   of a feast or entertainment; pastry, fruits, etc., forming the last\n   course at dinner.'),
(20579, 'Destin', 'n.', 'Destiny.'),
(20580, 'Destinal', 'a.', 'Determined by destiny; fated.'),
(20581, 'Destined', 'imp. & p. p.', 'of Destine'),
(20582, 'Destine', 'v. t.', 'To determine the future condition or application of; to\n   set apart by design for a future use or purpose; to fix, as by destiny\n   or by an authoritative decree; to doom; to ordain or preordain; to\n   appoint; -- often with the remoter object preceded by to or for.'),
(20583, 'Destiny', 'n.', 'That to which any person or thing is destined;\n   predetermined state; condition foreordained by the Divine or by human\n   will; fate; lot; doom.'),
(20584, 'Destiny', 'n.', 'The fixed order of things; invincible necessity; fate; a\n   resistless power or agency conceived of as determining the future,\n   whether in general or of an individual.'),
(20585, 'Destrer', 'n.', 'Alt. of Dextrer'),
(20586, 'Dextrer', 'n.', 'A war horse.'),
(20587, 'Destrie', 'v. t.', 'To destroy.'),
(20588, 'Destroy', 'v. t.', 'To unbuild; to pull or tear down; to separate\n   virulently into its constituent parts; to break up the structure and\n   organic existence of; to demolish.'),
(20589, 'Destroy', 'v. t.', 'To ruin; to bring to naught; to put an end to; to\n   annihilate; to consume.'),
(20590, 'Destroy', 'v. t.', 'To put an end to the existence, prosperity, or beauty\n   of; to kill.'),
(20591, 'Destruct', 'v. t.', 'To destroy.'),
(20592, 'Destruie', 'v. t.', 'To destroy.'),
(20593, 'Desuete', 'a.', 'Disused; out of use.'),
(20594, 'Desume', 'v. t.', 'To select; to borrow.'),
(20595, 'Detached', 'imp. & p. p.', 'of Detach'),
(20596, 'Detach', 'v. t.', 'To part; to separate or disunite; to disengage; -- the\n   opposite of attach; as, to detach the coats of a bulbous root from each\n   other; to detach a man from a leader or from a party.'),
(20597, 'Detach', 'v. t.', 'To separate for a special object or use; -- used\n   especially in military language; as, to detach a ship from a fleet, or\n   a company from a regiment.'),
(20598, 'Detach', 'v. i.', 'To push asunder; to come off or separate from anything;\n   to disengage.'),
(20599, 'Detached', 'a.', 'Separate; unconnected, or imperfectly connected; as,\n   detached parcels.'),
(20600, 'Detail', 'n.', 'A minute portion; one of the small parts; a particular; an\n   item; -- used chiefly in the plural; as, the details of a scheme or\n   transaction.'),
(20601, 'Detail', 'n.', 'A narrative which relates minute points; an account which\n   dwells on particulars.'),
(20602, 'Detail', 'n.', 'The selection for a particular service of a person or a\n   body of men; hence, the person or the body of men so selected.'),
(20603, 'Detailed', 'imp. & p. p.', 'of Detail'),
(20604, 'Detail', 'n.', 'To relate in particulars; to particularize; to report\n   minutely and distinctly; to enumerate; to specify; as, he detailed all\n   the facts in due order.'),
(20605, 'Detail', 'n.', 'To tell off or appoint for a particular service, as an\n   officer, a troop, or a squadron.'),
(20606, 'Detailer', 'n.', 'One who details.'),
(20607, 'Detained', 'imp. & p. p.', 'of Detain'),
(20608, 'Detain', 'v. t.', 'To keep back or from; to withhold.'),
(20609, 'Detain', 'v. t.', 'To restrain from proceeding; to stay or stop; to delay;\n   as, we were detained by an accident.'),
(20610, 'Detain', 'v. t.', 'To hold or keep in custody.'),
(20611, 'Detain', 'n.', 'Detention.'),
(20612, 'Detainer', 'n.', 'One who detains.'),
(20613, 'Detainer', 'n.', 'The keeping possession of what belongs to another;\n   detention of what is another\'s, even though the original taking may\n   have been lawful. Forcible detainer is indictable at common law.'),
(20614, 'Detainer', 'n.', 'A writ authorizing the keeper of a prison to continue to\n   keep a person in custody.'),
(20615, 'Detect', 'a.', 'Detected.'),
(20616, 'Detected', 'imp. & p. p.', 'of Detect'),
(20617, 'Detect', 'v. t.', 'To uncover; to discover; to find out; to bring to light;\n   as, to detect a crime or a criminal; to detect a mistake in an account.'),
(20618, 'Detect', 'v. t.', 'To inform against; to accuse.'),
(20619, 'Detecter', 'n.', 'One who, or that which, detects or brings to light; one\n   who finds out what another attempts to conceal; a detector.'),
(20620, 'Detector', 'n.', 'One who, or that which, detects; a detecter.'),
(20621, 'Detent', 'n.', 'That which locks or unlocks a movement; a catch, pawl, or\n   dog; especially, in clockwork, the catch which locks and unlocks the\n   wheelwork in striking.'),
(20622, 'Deterred', 'imp. & p. p.', 'of Deter'),
(20623, 'Deter', 'v. t.', 'To prevent by fear; hence, to hinder or prevent from\n   action by fear of consequences, or difficulty, risk, etc.'),
(20624, 'Deterged', 'imp. & p. p.', 'of Deterge'),
(20625, 'Deterge', 'v. t.', 'To cleanse; to purge away, as foul or offending matter\n   from the body, or from an ulcer.'),
(20626, 'Detested', 'imp. & p. p.', 'of Detest'),
(20627, 'Detest', 'v. t.', 'To witness against; to denounce; to condemn.'),
(20628, 'Detest', 'v. t.', 'To hate intensely; to abhor; to abominate; to loathe;\n   as, we detest what is contemptible or evil.'),
(20629, 'Detester', 'n.', 'One who detes//'),
(20630, 'Dethrone', 'v. t.', 'To remove or drive from a throne; to depose; to divest\n   of supreme authority and dignity.'),
(20631, 'Detinue', 'n.', 'A person or thing detained'),
(20632, 'Detinue', 'n.', 'A form of action for the recovery of a personal chattel\n   wrongfully detained.'),
(20633, 'Detonate', 'v. i.', 'To explode with a sudden report; as, niter detonates\n   with sulphur.'),
(20634, 'Detonate', 'v. t.', 'To cause to explode; to cause to burn or inflame with\n   a sudden report.'),
(20635, 'Detonize', 'v. t. & i.', 'To explode, or cause to explode; to burn with an\n   explosion; to detonate.'),
(20636, 'Detorted', 'imp. & p. p.', 'of Detort'),
(20637, 'Detort', 'v. t.', 'To turn form the original or plain meaning; to pervert;\n   to wrest.'),
(20638, 'Detour', 'n.', 'A turning; a circuitous route; a deviation from a direct\n   course; as, the detours of the Mississippi.'),
(20639, 'Detract', 'v. t.', 'To take away; to withdraw.'),
(20640, 'Detract', 'v. t.', 'To take credit or reputation from; to defame.'),
(20641, 'Detract', 'v. i.', 'To take away a part or something, especially from one\'s\n   credit; to lessen reputation; to derogate; to defame; -- often with\n   from.'),
(20642, 'Detracor', 'n.', 'One who detracts; a derogator; a defamer.'),
(20643, 'Detrain', 'v. i. & t.', 'To alight, or to cause to alight, from a railway\n   train.'),
(20644, 'Detrect', 'v. t.', 'To refuse; to decline.'),
(20645, 'Detrital', 'a.', 'Pertaining to, or composed of, detritus.'),
(20646, 'Detrite', 'a.', 'Worn out.'),
(20647, 'Detritus', 'n.', 'A mass of substances worn off from solid bodies by\n   attrition, and reduced to small portions; as, diluvial detritus.'),
(20648, 'Detritus', 'n.', 'Hence: Any fragments separated from the body to which\n   they belonged; any product of disintegration.'),
(20649, 'Detruded', 'imp. & p. p.', 'of Detrude'),
(20650, 'Detrude', 'v. t.', 'To thrust down or out; to push down with force.'),
(20651, 'Dette', 'n.', 'Debt.'),
(20652, 'Detteles', 'a.', 'Free from debt.'),
(20653, 'Detur', 'n.', 'A present of books given to a meritorious undergraduate\n   student as a prize.'),
(20654, 'Deturb', 'v. t.', 'To throw down.'),
(20655, 'Deturn', 'v. t.', 'To turn away.'),
(20656, 'Deuce', 'n.', 'Two; a card or a die with two spots; as, the deuce of\n   hearts.'),
(20657, 'Deuce', 'n.', 'A condition of the score beginning whenever each side has\n   won three strokes in the same game (also reckoned \"40 all\"), and\n   reverted to as often as a tie is made until one of the sides secures\n   two successive strokes following a tie or deuce, which decides the\n   game.'),
(20658, 'Deuce', 'n.', 'The devil; a demon.'),
(20659, 'Deuced', 'a.', 'Devilish; excessive; extreme.'),
(20660, 'Deuse', 'a.', 'Alt. of Deused'),
(20661, 'Deused', 'a.', 'See Deuce, Deuced.'),
(20662, 'Deuto-', '', 'Alt. of Deut-'),
(20663, 'Deut-', '', 'A prefix which formerly properly indicated the second in a\n   regular series of compound in the series, and not to its composition,\n   but which is now generally employed in the same sense as bi-or di-,\n   although little used.'),
(20664, 'Deutzia', 'n.', 'A genus of shrubs with pretty white flowers, much\n   cultivated.'),
(20665, 'Devast', 'v. t.', 'To devastate.'),
(20666, 'Devata', 'n.', 'A deity; a divine being; a good spirit; an idol.'),
(20667, 'Develin', 'n.', 'The European swift.'),
(20668, 'Develop', 'v. t.', 'To free from that which infolds or envelops; to unfold;\n   to lay open by degrees or in detail; to make visible or known; to\n   disclose; to produce or give forth; as, to develop theories; a motor\n   that develops 100 horse power.'),
(20669, 'Develop', 'v. t.', 'To unfold gradually, as a flower from a bud; hence, to\n   bring through a succession of states or stages, each of which is\n   preparatory to the next; to form or expand by a process of growth; to\n   cause to change gradually from an embryo, or a lower state, to a higher\n   state or form of being; as, sunshine and rain develop the bud into a\n   flower; to develop the mind.'),
(20670, 'Develop', 'v. t.', 'To advance; to further; to prefect; to make to\n   increase; to promote the growth of.'),
(20671, 'Develop', 'v. t.', 'To change the form of, as of an algebraic expression,\n   by executing certain indicated operations without changing the value.'),
(20672, 'Develop', 'v. t.', 'To cause to become visible, as an invisible or latent\n   image upon plate, by submitting it to chemical agents; to bring to\n   view.'),
(20673, 'Develop', 'v. i.', 'To go through a process of natural evolution or growth,\n   by successive changes from a less perfect to a more perfect or more\n   highly organized state; to advance from a simpler form of existence to\n   one more complex either in structure or function; as, a blossom\n   develops from a bud; the seed develops into a plant; the embryo\n   develops into a well-formed animal; the mind develops year by year.'),
(20674, 'Develop', 'v. i.', 'To become apparent gradually; as, a picture on\n   sensitive paper develops on the application of heat; the plans of the\n   conspirators develop.'),
(20675, 'Devested', 'imp. & p. p.', 'of Devest'),
(20676, 'Devest', 'v. t.', 'To divest; to undress.'),
(20677, 'Devest', 'v. t.', 'To take away, as an authority, title, etc., to deprive;\n   to alienate, as an estate.'),
(20678, 'Devest', 'v. i.', 'To be taken away, lost, or alienated, as a title or an\n   estate.'),
(20679, 'Devex', 'a.', 'Bending down; sloping.'),
(20680, 'Devex', 'n.', 'Devexity.'),
(20681, 'Devexity', 'a.', 'A bending downward; a sloping; incurvation downward;\n   declivity.'),
(20682, 'Deviant', 'a.', 'Deviating.'),
(20683, 'Deviated', 'imp. & p. p.', 'of Deviate'),
(20684, 'Deviate', 'v. i.', 'To go out of the way; to turn aside from a course or a\n   method; to stray or go astray; to err; to digress; to diverge; to vary.'),
(20685, 'Deviate', 'v. t.', 'To cause to deviate.'),
(20686, 'Deviator', 'n.', 'One who, or that which, deviates.'),
(20687, 'Device', 'n.', 'That which is devised, or formed by design; a contrivance;\n   an invention; a project; a scheme; often, a scheme to deceive; a\n   stratagem; an artifice.'),
(20688, 'Device', 'n.', 'Power of devising; invention; contrivance.'),
(20689, 'Device', 'n.', 'An emblematic design, generally consisting of one or more\n   figures with a motto, used apart from heraldic bearings to denote the\n   historical situation, the ambition, or the desire of the person\n   adopting it. See Cognizance.'),
(20690, 'Device', 'n.', 'Improperly, an heraldic bearing.'),
(20691, 'Device', 'n.', 'Anything fancifully conceived.'),
(20692, 'Device', 'n.', 'A spectacle or show.'),
(20693, 'Device', 'n.', 'Opinion; decision.'),
(20694, 'Devil', 'n.', 'The Evil One; Satan, represented as the tempter and\n   spiritual of mankind.'),
(20695, 'Devil', 'n.', 'An evil spirit; a demon.'),
(20696, 'Devil', 'n.', 'A very wicked person; hence, any great evil.'),
(20697, 'Devil', 'n.', 'An expletive of surprise, vexation, or emphasis, or,\n   ironically, of negation.'),
(20698, 'Devil', 'n.', 'A dish, as a bone with the meat, broiled and excessively\n   peppered; a grill with Cayenne pepper.'),
(20699, 'Devil', 'n.', 'A machine for tearing or cutting rags, cotton, etc.'),
(20700, 'Deviled', 'imp. & p. p.', 'of Devil'),
(20701, 'Devilled', '', 'of Devil'),
(20702, 'Deviling', 'p. pr. & vb. n.', 'of Devil'),
(20703, 'Devil', 'v. t.', 'To make like a devil; to invest with the character of a\n   devil.'),
(20704, 'Devil', 'v. t.', 'To grill with Cayenne pepper; to season highly in\n   cooking, as with pepper.'),
(20705, 'Deviless', 'n.', 'A she-devil.'),
(20706, 'Devilet', 'n.', 'A little devil.'),
(20707, 'Deviling', 'n.', 'A young devil.'),
(20708, 'Devilish', 'a.', 'Resembling, characteristic of, or pertaining to, the\n   devil; diabolical; wicked in the extreme.'),
(20709, 'Devilish', 'a.', 'Extreme; excessive.'),
(20710, 'Devilism', 'n.', 'The state of the devil or of devils; doctrine of the\n   devil or of devils.'),
(20711, 'Devilize', 'v. t.', 'To make a devil of.'),
(20712, 'Devilkin', 'n.', 'A little devil; a devilet.'),
(20713, 'Devilry', 'n.', 'Conduct suitable to the devil; extreme wickedness;\n   deviltry.'),
(20714, 'Devilry', 'n.', 'The whole body of evil spirits.'),
(20715, 'Deviltry', 'n.', 'Diabolical conduct; malignant mischief; devilry.'),
(20716, 'Devious', 'a.', 'Out of a straight line; winding; varying from directness;\n   as, a devious path or way.'),
(20717, 'Devious', 'a.', 'Going out of the right or common course; going astray;\n   erring; wandering; as, a devious step.'),
(20718, 'Devisal', 'n.', 'A devising.'),
(20719, 'Devised', 'imp. & p. p.', 'of Devise'),
(20720, 'Devising', 'p. pr. & vb. n.', 'of Devise'),
(20721, 'Devise', 'v. t.', 'To form in the mind by new combinations of ideas, new\n   applications of principles, or new arrangement of parts; to formulate\n   by thought; to contrive; to excogitate; to invent; to plan; to scheme;\n   as, to devise an engine, a new mode of writing, a plan of defense, or\n   an argument.'),
(20722, 'Devise', 'v. t.', 'To plan or scheme for; to purpose to obtain.'),
(20723, 'Devise', 'v. t.', 'To say; to relate; to describe.'),
(20724, 'Devise', 'v. t.', 'To imagine; to guess.'),
(20725, 'Devise', 'v. t.', 'To give by will; -- used of real estate; formerly, also,\n   of chattels.'),
(20726, 'Devise', 'v. i.', 'To form a scheme; to lay a plan; to contrive; to\n   consider.'),
(20727, 'Devise', 'n.', 'The act of giving or disposing of real estate by will; --\n   sometimes improperly applied to a bequest of personal estate.'),
(20728, 'Devise', 'n.', 'A will or testament, conveying real estate; the clause of a\n   will making a gift of real property.'),
(20729, 'Devise', 'n.', 'Property devised, or given by will.'),
(20730, 'Devise', 'n.', 'Device. See Device.'),
(20731, 'Devisee', 'n.', 'One to whom a devise is made, or real estate given by\n   will.'),
(20732, 'Deviser', 'n.', 'One who devises.'),
(20733, 'Devisor', 'n.', 'One who devises, or gives real estate by will; a testator;\n   -- correlative to devisee.'),
(20734, 'Devoid', 'v. t.', 'To empty out; to remove.'),
(20735, 'Devoid', 'v. t.', 'Void; empty; vacant.'),
(20736, 'Devoid', 'v. t.', 'Destitute; not in possession; -- with of; as, devoid of\n   sense; devoid of pity or of pride.'),
(20737, 'Devoir', 'n.', 'Duty; service owed; hence, due act of civility or respect;\n   -- now usually in the plural; as, they paid their devoirs to the\n   ladies.'),
(20738, 'Devolute', 'v. t.', 'To devolve.'),
(20739, 'Devolved', 'imp. & p. p.', 'of Devolve'),
(20740, 'Devolve', 'v. t.', 'To roll onward or downward; to pass on.'),
(20741, 'Devolve', 'v. t.', 'To transfer from one person to another; to deliver\n   over; to hand down; -- generally with upon, sometimes with to or into.'),
(20742, 'Devolve', 'v. i.', 'To pass by transmission or succession; to be handed\n   over or down; -- generally with on or upon, sometimes with to or into;\n   as, after the general fell, the command devolved upon (or on) the next\n   officer in rank.'),
(20743, 'Devon', 'n.', 'One of a breed of hardy cattle originating in the country of\n   Devon, England. Those of pure blood have a deep red color. The small,\n   longhorned variety, called North Devons, is distinguished by the\n   superiority of its working oxen.'),
(20744, 'Devonian', 'a.', 'Of or pertaining to Devon or Devonshire in England; as,\n   the Devonian rocks, period, or system.'),
(20745, 'Devonian', 'n.', 'The Devonian age or formation.'),
(20746, 'Devotary', 'n.', 'A votary.'),
(20747, 'Devoted', 'imp. & p. p.', 'of Devote'),
(20748, 'Devoting', 'p. pr. & vb. n.', 'of Devote'),
(20749, 'Devote', 'v. t.', 'To appropriate by vow; to set apart or dedicate by a\n   solemn act; to consecrate; also, to consign over; to doom; to evil; to\n   devote one to destruction; the city was devoted to the flames.'),
(20750, 'Devote', 'v. t.', 'To execrate; to curse.'),
(20751, 'Devote', 'v. t.', 'To give up wholly; to addict; to direct the attention of\n   wholly or compound; to attach; -- often with a reflexive pronoun; as,\n   to devote one\'s self to science, to one\'s friends, to piety, etc.'),
(20752, 'Devote', 'a.', 'Devoted; addicted; devout.'),
(20753, 'Devote', 'n.', 'A devotee.'),
(20754, 'Devoted', 'a.', 'Consecrated to a purpose; strongly attached; zealous;\n   devout; as, a devoted admirer.'),
(20755, 'Devotee', 'n.', 'One who is wholly devoted; esp., one given wholly to\n   religion; one who is superstitiously given to religious duties and\n   ceremonies; a bigot.'),
(20756, 'Devoter', 'n.', 'One who devotes; a worshiper.'),
(20757, 'Devotion', 'n.', 'The act of devoting; consecration.'),
(20758, 'Devotion', 'n.', 'The state of being devoted; addiction; eager inclination;\n   strong attachment love or affection; zeal; especially, feelings toward\n   God appropriately expressed by acts of worship; devoutness.'),
(20759, 'Devotion', 'n.', 'Act of devotedness or devoutness; manifestation of strong\n   attachment; act of worship; prayer.'),
(20760, 'Devotion', 'n.', 'Disposal; power of disposal.'),
(20761, 'Devotion', 'n.', 'A thing consecrated; an object of devotion.'),
(20762, 'Devoto', 'n.', 'A devotee.'),
(20763, 'Devotor', 'n.', 'A worshiper; one given to devotion.'),
(20764, 'Devoured', 'imp. & p. p.', 'of Devour'),
(20765, 'Devour', 'v. t.', 'To eat up with greediness; to consume ravenously; to\n   feast upon like a wild beast or a glutton; to prey upon.'),
(20766, 'Devour', 'v. t.', 'To seize upon and destroy or appropriate greedily,\n   selfishly, or wantonly; to consume; to swallow up; to use up; to waste;\n   to annihilate.'),
(20767, 'Devour', 'v. t.', 'To enjoy with avidity; to appropriate or take in eagerly\n   by the senses.'),
(20768, 'Devourer', 'n.', 'One who, or that which, devours.'),
(20769, 'Devout', 'v. t.', 'Devoted to religion or to religious feelings and duties;\n   absorbed in religious exercises; given to devotion; pious; reverent;\n   religious.'),
(20770, 'Devout', 'v. t.', 'Expressing devotion or piety; as, eyes devout; sighs\n   devout; a devout posture.'),
(20771, 'Devout', 'v. t.', 'Warmly devoted; hearty; sincere; earnest; as, devout\n   wishes for one\'s welfare.'),
(20772, 'Devout', 'n.', 'A devotee.'),
(20773, 'Devout', 'n.', 'A devotional composition, or part of a composition;\n   devotion.'),
(20774, 'Devoutly', 'adv.', 'In a devout and reverent manner; with devout emotions;\n   piously.'),
(20775, 'Devoutly', 'adv.', 'Sincerely; solemnly; earnestly.'),
(20776, 'Devove', 'v. t.', 'To devote.'),
(20777, 'Devow', 'v. t.', 'To give up; to devote.'),
(20778, 'Devow', 'v. t.', 'To disavow; to disclaim.'),
(20779, 'Dewed', 'imp. & p. p.', 'of Dew'),
(20780, 'Dewing', 'p. pr. & vb. n.', 'of Dew'),
(20781, 'Dewberry', 'n.', 'The fruit of certain species of bramble (Rubus); in\n   England, the fruit of R. caesius, which has a glaucous bloom; in\n   America, that of R. canadensis and R. hispidus, species of low\n   blackberries.'),
(20782, 'Dewberry', 'n.', 'The plant which bears the fruit.'),
(20783, 'Dewclaw', 'n.', 'In any animal, esp. of the Herbivora, a rudimentary claw\n   or small hoof not reaching the ground.'),
(20784, 'Dewdrop', 'n.', 'A drop of dew.'),
(20785, 'Dewfall', 'n.', 'The falling of dew; the time when dew begins to fall.'),
(20786, 'Dewiness', 'n.', 'State of being dewy.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(20787, 'Dewlap', 'n.', 'The pendulous skin under the neck of an ox, which laps or\n   licks the dew in grazing.'),
(20788, 'Dewlap', 'n.', 'The flesh upon the human throat, especially when with age.'),
(20789, 'Dewless', 'a.', 'Having no dew.'),
(20790, 'Dewret', 'v. t.', 'To ret or rot by the process called dewretting.'),
(20791, 'Dewrot', 'v. t.', 'To rot, as flax or hemp, by exposure to rain, dew, and\n   sun. See Dewretting.'),
(20792, 'Dewworm', 'n.', 'See Earthworm.'),
(20793, 'Dexter', 'a.', 'Pertaining to, or situated on, the right hand; right, as\n   opposed to sinister, or left.'),
(20794, 'Dexter', 'a.', 'On the right-hand side of a shield, i. e., towards the\n   right hand of its wearer. To a spectator in front, as in a pictorial\n   representation, this would be the left side.'),
(20795, 'Dextrad', 'adv.', 'Toward the right side; dextrally.'),
(20796, 'Dextral', 'a.', 'Right, as opposed to sinistral, or left.'),
(20797, 'Dextrer', 'n.', 'A war horse; a destrer.'),
(20798, 'Dextrin', 'n.', 'A translucent, gummy, amorphous substance, nearly\n   tasteless and odorless, used as a substitute for gum, for sizing, etc.,\n   and obtained from starch by the action of heat, acids, or diastase. It\n   is of somewhat variable composition, containing several carbohydrates\n   which change easily to their respective varieties of sugar. It is so\n   named from its rotating the plane of polarization to the right; --\n   called also British gum, Alsace gum, gommelin, leiocome, etc. See\n   Achroodextrin, and Erythrodextrin.'),
(20799, 'Dextro-', '', 'A prefix, from L. dexter, meaning, pertaining to, or toward,\n   the right'),
(20800, 'Dextro-', '', 'having the property of turning the plane of polarized light\n   to the right; as, dextrotartaric acid.'),
(20801, 'Dextrose', 'n.', 'A sirupy, or white crystalline, variety of sugar, C6H12O6\n   (so called from turning the plane of polarization to the right),\n   occurring in many ripe fruits. Dextrose and levulose are obtained by\n   the inversion of cane sugar or sucrose, and hence called invert sugar.\n   Dextrose is chiefly obtained by the action of heat and acids on starch,\n   and hence called also starch sugar. It is also formed from starchy food\n   by the action of the amylolytic ferments of saliva and pancreatic\n   juice.'),
(20802, 'Dextrous', 'n.', 'Alt. of Dextrousness'),
(20803, 'Deynte', 'n. & a.', 'Alt. of Deyntee'),
(20804, 'Deyntee', 'n. & a.', 'See Dainty.'),
(20805, 'Dhole', 'n.', 'A fierce, wild dog (Canis Dukhunensis), found in the\n   mountains of India. It is remarkable for its propensity to hunt the\n   tiger and other wild animals in packs.'),
(20806, 'Dhony', 'n.', 'A Ceylonese boat. See Doni.'),
(20807, 'Dhoorra', 'n.', 'Alt. of Dhurra'),
(20808, 'Dhourra', 'n.', 'Alt. of Dhurra'),
(20809, 'Dhurra', 'n.', 'Indian millet. See Durra.'),
(20810, 'Diabase', 'n.', 'A basic, dark-colored, holocrystalline, igneous rock,\n   consisting essentially of a triclinic feldspar and pyroxene with\n   magnetic iron; -- often limited to rocks pretertiary in age. It\n   includes part of what was early called greenstone.'),
(20811, 'Diabetes', 'n.', 'A disease which is attended with a persistent, excessive\n   discharge of urine. Most frequently the urine is not only increased in\n   quantity, but contains saccharine matter, in which case the disease is\n   generally fatal.'),
(20812, 'Diabetic', 'a.', 'Alt. of Diabetical'),
(20813, 'Diabley', 'n.', 'Devilry; sorcery or incantation; a diabolical deed;\n   mischief.'),
(20814, 'Diabolic', 'a.', 'Alt. of Diabolical'),
(20815, 'Diacid', 'a.', 'Divalent; -- said of a base or radical as capable of\n   saturating two acid monad radicals or a dibasic acid. Cf. Dibasic, a.,\n   and Biacid.'),
(20816, 'Diaconal', 'a.', 'Of or pertaining to a deacon.'),
(20817, 'Diacope', 'n.', 'Tmesis.'),
(20818, 'Diadem', 'n.', 'Originally, an ornamental head band or fillet, worn by\n   Eastern monarchs as a badge of royalty; hence (later), also, a crown,\n   in general.'),
(20819, 'Diadem', 'n.', 'Regal power; sovereignty; empire; -- considered as\n   symbolized by the crown.'),
(20820, 'Diadem', 'n.', 'An arch rising from the rim of a crown (rarely also of a\n   coronet), and uniting with others over its center.'),
(20821, 'Diadem', 'v. t.', 'To adorn with a diadem; to crown.'),
(20822, 'Diadrom', 'n.', 'A complete course or vibration; time of vibration, as of a\n   pendulum.'),
(20823, 'Diereses', 'pl. ', 'of Dieresis'),
(20824, 'Dieresis', 'n.', 'The separation or resolution of one syllable into two; --\n   the opposite of synaeresis.'),
(20825, 'Dieresis', 'n.', 'A mark consisting of two dots [/], placed over the second\n   of two adjacent vowels, to denote that they are to be pronounced as\n   distinct letters; as, cooperate, aerial.'),
(20826, 'Diaglyph', 'n.', 'An intaglio.'),
(20827, 'Diagnose', 'v. t. & i.', 'To ascertain by diagnosis; to diagnosticate. See\n   Diagnosticate.'),
(20828, 'Diagonal', 'a.', 'Joining two not adjacent angles of a quadrilateral or\n   multilateral figure; running across from corner to corner; crossing at\n   an angle with one of the sides.'),
(20829, 'Diagonal', 'n.', 'A right line drawn from one angle to another not\n   adjacent, of a figure of four or more sides, and dividing it into two\n   parts.'),
(20830, 'Diagonal', 'n.', 'A member, in a framed structure, running obliquely across\n   a panel.'),
(20831, 'Diagonal', 'n.', 'A diagonal cloth; a kind of cloth having diagonal\n   stripes, ridges, or welts made in the weaving.'),
(20832, 'Diagram', 'n.', 'A figure or drawing made to illustrate a statement, or\n   facilitate a demonstration; a plan.'),
(20833, 'Diagram', 'n.', 'Any simple drawing made for mathematical or scientific\n   purposes, or to assist a verbal explanation which refers to it; a\n   mechanical drawing, as distinguished from an artistical one.'),
(20834, 'Diagram', 'v. t.', 'To put into the form of a diagram.'),
(20835, 'Diagraph', 'n.', 'A drawing instrument, combining a protractor and scale.'),
(20836, 'Dialed', 'imp. & p. p.', 'of Dial'),
(20837, 'Dialled', '', 'of Dial'),
(20838, 'Dialing', 'p. pr. & vb. n.', 'of Dial'),
(20839, 'Dialling', '', 'of Dial'),
(20840, 'Dialect', 'n.', 'Means or mode of expressing thoughts; language; tongue;\n   form of speech.'),
(20841, 'Dialect', 'n.', 'The form of speech of a limited region or people, as\n   distinguished from ether forms nearly related to it; a variety or\n   subdivision of a language; speech characterized by local peculiarities\n   or specific circumstances; as, the Ionic and Attic were dialects of\n   Greece; the Yorkshire dialect; the dialect of the learned.'),
(20842, 'Dialing', 'n.', 'The art of constructing dials; the science which treats of\n   measuring time by dials.'),
(20843, 'Dialing', 'n.', 'A method of surveying, especially in mines, in which the\n   bearings of the courses, or the angles which they make with each other,\n   are determined by means of the circumferentor.'),
(20844, 'Dialist', 'n.', 'A maker of dials; one skilled in dialing.'),
(20845, 'Diallage', 'n.', 'A figure by which arguments are placed in various points\n   of view, and then turned to one point.'),
(20846, 'Diallage', 'n.', 'A dark green or bronze-colored laminated variety of\n   pyroxene, common in certain igneous rocks.'),
(20847, 'Diallel', 'a.', 'Meeting and intersecting, as lines; not parallel; --\n   opposed to parallel.'),
(20848, 'Diallyl', 'n.', 'A volatile, pungent, liquid hydrocarbon, C6H10, consisting\n   of two allyl radicals, and belonging to the acetylene series.'),
(20849, 'Dialogue', 'n.', 'A conversation between two or more persons; particularly,\n   a formal conservation in theatrical performances or in scholastic\n   exercises.'),
(20850, 'Dialogue', 'n.', 'A written composition in which two or more persons are\n   represented as conversing or reasoning on some topic; as, the Dialogues\n   of Plato.'),
(20851, 'Dialogue', 'v. i.', 'To take part in a dialogue; to dialogize.'),
(20852, 'Dialogue', 'v. t.', 'To express as in dialogue.'),
(20853, 'Dialyses', 'pl. ', 'of Dialysis'),
(20854, 'Dialysis', 'n.', 'Diaeresis. See Diaeresis, 1.'),
(20855, 'Dialysis', 'n.', 'Same as Asyndeton.'),
(20856, 'Dialysis', 'n.', 'Debility.'),
(20857, 'Dialysis', 'n.', 'A solution of continuity; division; separation of parts.'),
(20858, 'Dialysis', 'n.', 'The separation of different substances in solution, as\n   crystalloids and colloids, by means of their unequal diffusion,\n   especially through natural or artificial membranes.'),
(20859, 'Dialytic', 'a.', 'Having the quality of unloosing or separating.'),
(20860, 'Dialyzed', 'imp. & p. p.', 'of Dialyze'),
(20861, 'Dialyze', 'v. t.', 'To separate, prepare, or obtain, by dialysis or osmose;\n   to pass through an animal membrane; to subject to dialysis.'),
(20862, 'Dialyzed', 'a.', 'Prepared by diffusion through an animal membrane; as,\n   dialyzed iron.'),
(20863, 'Dialyzer', 'n.', 'The instrument or medium used to effect chemical\n   dialysis.'),
(20864, 'Diameter', 'n.', 'Any right line passing through the center of a figure or\n   body, as a circle, conic section, sphere, cube, etc., and terminated by\n   the opposite boundaries; a straight line which bisects a system of\n   parallel chords drawn in a curve.'),
(20865, 'Diameter', 'n.', 'A diametral plane.'),
(20866, 'Diameter', 'n.', 'The length of a straight line through the center of an\n   object from side to side; width; thickness; as, the diameter of a tree\n   or rock.'),
(20867, 'Diameter', 'n.', 'The distance through the lower part of the shaft of a\n   column, used as a standard measure for all parts of the order. See\n   Module.'),
(20868, 'Diamide', 'n.', 'Any compound containing two amido groups united with one\n   or more acid or negative radicals, -- as distinguished from a diamine.\n   Cf. Amido acid, under Amido, and Acid amide, under Amide.'),
(20869, 'Diamido-', 'a.', 'A prefix or combining form of Diamine. [Also used\n   adjectively.]'),
(20870, 'Diamine', 'n.', 'A compound containing two amido groups united with one or\n   more basic or positive radicals, -- as contrasted with a diamide.'),
(20871, 'Diamond', 'n.', 'A precious stone or gem excelling in brilliancy and\n   beautiful play of prismatic colors, and remarkable for extreme\n   hardness.'),
(20872, 'Diamond', 'n.', 'A geometrical figure, consisting of four equal straight\n   lines, and having two of the interior angles acute and two obtuse; a\n   rhombus; a lozenge.'),
(20873, 'Diamond', 'n.', 'One of a suit of playing cards, stamped with the figure of\n   a diamond.'),
(20874, 'Diamond', 'n.', 'A pointed projection, like a four-sided pyramid, used for\n   ornament in lines or groups.'),
(20875, 'Diamond', 'n.', 'The infield; the square space, 90 feet on a side, having\n   the bases at its angles.'),
(20876, 'Diamond', 'n.', 'The smallest kind of type in English printing, except that\n   called brilliant, which is seldom seen.'),
(20877, 'Diamond', 'a.', 'Resembling a diamond; made of, or abounding in, diamonds;\n   as, a diamond chain; a diamond field.'),
(20878, 'Diana', 'n.', 'The daughter of Jupiter and Latona; a virgin goddess who\n   presided over hunting, chastity, and marriage; -- identified with the\n   Greek goddess Artemis.'),
(20879, 'Diandria', 'n. pl.', 'A Linnaean class of plants having two stamens.'),
(20880, 'Dianium', 'n.', 'Same as Columbium.'),
(20881, 'Dianthus', 'n.', 'A genus of plants containing some of the most popular of\n   cultivated flowers, including the pink, carnation, and Sweet William.'),
(20882, 'Diapase', 'n.', 'Same as Diapason.'),
(20883, 'Diapasm', 'n.', 'Powdered aromatic herbs, sometimes made into little balls\n   and strung together.'),
(20884, 'Diapason', 'n.', 'The octave, or interval which includes all the tones of\n   the diatonic scale.'),
(20885, 'Diapason', 'n.', 'Concord, as of notes an octave apart; harmony.'),
(20886, 'Diapason', 'n.', 'The entire compass of tones.'),
(20887, 'Diapason', 'n.', 'A standard of pitch; a tuning fork; as, the French normal\n   diapason.'),
(20888, 'Diapason', 'n.', 'One of certain stops in the organ, so called because they\n   extend through the scale of the instrument. They are of several kinds,\n   as open diapason, stopped diapason, double diapason, and the like.'),
(20889, 'Diapente', 'n.', 'The interval of the fifth.'),
(20890, 'Diapente', 'n.', 'A composition of five ingredients.'),
(20891, 'Diaper', 'n.', 'Any textile fabric (esp. linen or cotton toweling) woven in\n   diaper pattern. See 2.'),
(20892, 'Diaper', 'n.', 'Surface decoration of any sort which consists of the\n   constant repetition of one or more simple figures or units of design\n   evenly spaced.'),
(20893, 'Diaper', 'n.', 'A towel or napkin for wiping the hands, etc.'),
(20894, 'Diaper', 'n.', 'An infant\'s breechcloth.'),
(20895, 'Diaper', 'v. t.', 'To ornament with figures, etc., arranged in the pattern\n   called diaper, as cloth in weaving.'),
(20896, 'Diaper', 'v. t.', 'To put a diaper on (a child).'),
(20897, 'Diaper', 'v. i.', 'To draw flowers or figures, as upon cloth.'),
(20898, 'Diaphane', 'n.', 'A woven silk stuff with transparent and colored figures;\n   diaper work.'),
(20899, 'Diaphote', 'n.', 'An instrument designed for transmitting pictures by\n   telegraph.'),
(20900, 'Diapnoic', 'a.', 'Slightly increasing an insensible perspiration; mildly\n   diaphoretic.'),
(20901, 'Diapnoic', 'n.', 'A gentle diaphoretic.'),
(20902, 'Diarchy', 'n.', 'A form of government in which the supreme power is vested\n   in two persons.'),
(20903, 'Diarial', 'a.', 'Alt. of Diarian'),
(20904, 'Diarian', 'a.', 'Pertaining to a diary; daily.'),
(20905, 'Diarist', 'n.', 'One who keeps a diary.'),
(20906, 'Diarrhea', 'n.', 'Alt. of Diarrhoea'),
(20907, 'Diaries', 'pl. ', 'of Diary'),
(20908, 'Diary', 'n.', 'A register of daily events or transactions; a daily record;\n   a journal; a blank book dated for the record of daily memoranda; as, a\n   diary of the weather; a physician\'s diary.'),
(20909, 'Diary', 'a.', 'lasting for one day; as, a diary fever.'),
(20910, 'Diaspore', 'n.', 'A hydrate of alumina, often occurring in white lamellar\n   masses with brilliant pearly luster; -- so named on account of its\n   decrepitating when heated before the blowpipe.'),
(20911, 'Diastase', 'n.', 'A soluble, nitrogenous ferment, capable of converting\n   starch and dextrin into sugar.'),
(20912, 'Diastem', 'n.', 'Intervening space; interval.'),
(20913, 'Diastem', 'n.', 'An interval.'),
(20914, 'Diastema', 'n.', 'A vacant space, or gap, esp. between teeth in a jaw.'),
(20915, 'Diaster', 'n.', 'A double star; -- applied to the nucleus of a cell, when,\n   during cell division, the loops of the nuclear network separate into\n   two groups, preparatory to the formation of two daughter nuclei. See\n   Karyokinesis.'),
(20916, 'Diastole', 'n.', 'The rhythmical expansion or dilatation of the heart and\n   arteries; -- correlative to systole, or contraction.'),
(20917, 'Diastole', 'n.', 'A figure by which a syllable naturally short is made\n   long.'),
(20918, 'Diastyle', 'n.', 'See under Intercolumniation.'),
(20919, 'Diatom', 'n.', 'One of the Diatomaceae, a family of minute unicellular\n   Algae having a siliceous covering of great delicacy, each individual\n   multiplying by spontaneous division. By some authors diatoms are called\n   Bacillariae, but this word is not in general use.'),
(20920, 'Diatom', 'n.', 'A particle or atom endowed with the vital principle.'),
(20921, 'Diatomic', 'a.', 'Containing two atoms.'),
(20922, 'Diatomic', 'a.', 'Having two replaceable atoms or radicals.'),
(20923, 'Diatonic', 'a.', 'Pertaining to the scale of eight tones, the eighth of\n   which is the octave of the first.'),
(20924, 'Diatribe', 'n.', 'A prolonged or exhaustive discussion; especially, an\n   acrimonious or invective harangue; a strain of abusive or railing\n   language; a philippic.'),
(20925, 'Diatryma', 'n.', 'An extinct eocene bird from New Mexico, larger than the\n   ostrich.'),
