(21166, 'Dimble', 'n.', 'A bower; a dingle.'),
(21167, 'Dimera', 'n. pl.', 'A division of Coleoptera, having two joints to the\n   tarsi.'),
(21168, 'Dimera', 'n. pl.', 'A division of the Hemiptera, including the aphids.'),
(21169, 'Dimeran', 'n.', 'One of the Dimera.'),
(21170, 'Dimerous', 'a.', 'Composed of, or having, two parts of each kind.'),
(21171, 'Dimeter', 'a.', 'Having two poetical measures or meters.'),
(21172, 'Dimeter', 'n.', 'A verse of two meters.'),
(21173, 'Dimethyl', 'n.', 'Ethane; -- sometimes so called because regarded as\n   consisting of two methyl radicals. See Ethane.'),
(21174, 'Dimetric', 'a.', 'Same as Tetragonal.'),
(21175, 'Diminish', 'v. t.', 'To make smaller in any manner; to reduce in bulk or\n   amount; to lessen; -- opposed to augment or increase.'),
(21176, 'Diminish', 'v. t.', 'To lessen the authority or dignity of; to put down; to\n   degrade; to abase; to weaken.'),
(21177, 'Diminish', 'v. t.', 'To make smaller by a half step; to make (an interval)\n   less than minor; as, a diminished seventh.'),
(21178, 'Diminish', 'v. t.', 'To take away; to subtract.'),
(21179, 'Diminish', 'v. i.', 'To become or appear less or smaller; to lessen; as,\n   the apparent size of an object diminishes as we recede from it.'),
(21180, 'Diminute', 'a.', 'Small; diminished; diminutive.'),
(21181, 'Dimish', 'a.', 'See Dimmish.'),
(21182, 'Dimit', 'v. t.', 'To dismiss, let go, or release.'),
(21183, 'Dimity', 'n.', 'A cotton fabric employed for hangings and furniture\n   coverings, and formerly used for women\'s under-garments. It is of many\n   patterns, both plain and twilled, and occasionally is printed in\n   colors.'),
(21184, 'Dimly', 'adv.', 'In a dim or obscure manner; not brightly or clearly; with\n   imperfect sight.'),
(21185, 'Dimmish', 'a.', 'Alt. of Dimmy'),
(21186, 'Dimmy', 'a.', 'Somewhat dim; as, dimmish eyes.'),
(21187, 'Dimness', 'n.', 'The state or quality / being dim; lack of brightness,\n   clearness, or distinctness; dullness; obscurity.'),
(21188, 'Dimness', 'n.', 'Dullness, or want of clearness, of vision or of\n   intellectual perception.'),
(21189, 'Dimorph', 'n.', 'Either one of the two forms of a dimorphous substance; as,\n   calcite and aragonite are dimorphs.'),
(21190, 'Dimple', 'n.', 'A slight natural depression or indentation on the surface\n   of some part of the body, esp. on the cheek or chin.'),
(21191, 'Dimple', 'n.', 'A slight indentation on any surface.'),
(21192, 'Dimpled', 'imp. & p. p.', 'of Dimple'),
(21193, 'Dimpling', 'p. pr. & vb. n.', 'of Dimple'),
(21194, 'Dimple', 'v. i.', 'To form dimples; to sink into depressions or little\n   inequalities.'),
(21195, 'Dimple', 'v. t.', 'To mark with dimples or dimplelike depressions.'),
(21196, 'Dimply', 'a.', 'Full of dimples, or small depressions; dimpled; as, the\n   dimply pool.'),
(21197, 'Dimya', 'n. pl.', 'Alt. of Dimyaria'),
(21198, 'Dimyaria', 'n. pl.', 'An order of lamellibranchiate mollusks having an\n   anterior and posterior adductor muscle, as the common clam. See\n   Bivalve.'),
(21199, 'Dimyary', 'a. & n.', 'Same as Dimyarian.'),
(21200, 'Dinned', 'imp. & p. p.', 'of Din'),
(21201, 'Dinning', 'p. pr. & vb. n.', 'of Din'),
(21202, 'Dinar', 'n.', 'A petty money of accounts of Persia.'),
(21203, 'Dinar', 'n.', 'An ancient gold coin of the East.'),
(21204, 'Dinarchy', 'n.', 'See Diarchy.'),
(21205, 'Dined', 'imp. & p. p.', 'of Dine'),
(21206, 'Dining', 'p. pr. & vb. n.', 'of Dine'),
(21207, 'Diner', 'n.', 'One who dines.'),
(21208, 'Dinged', 'imp. & p. p.', 'of Ding'),
(21209, 'Dinging', 'p. pr. & vb. n.', 'of Ding'),
(21210, 'Dingdong', 'n.', 'The sound of, or as of, repeated strokes on a metallic\n   body, as a bell; a repeated and monotonous sound.'),
(21211, 'Dingdong', 'n.', 'An attachment to a clock by which the quarter hours are\n   struck upon bells of different tones.'),
(21212, 'Dingey', 'n.', 'Alt. of Dinghy'),
(21213, 'Dingy', 'n.', 'Alt. of Dinghy'),
(21214, 'Dinghy', 'n.', 'A kind of boat used in the East Indies.'),
(21215, 'Dinghy', 'n.', 'A ship\'s smallest boat.'),
(21216, 'Dingily', 'adv.', 'In a dingy manner.'),
(21217, 'Dingle', 'n.', 'A narrow dale; a small dell; a small, secluded, and\n   embowered valley.'),
(21218, 'Dingo', 'n.', 'A wild dog found in Australia, but supposed to have\n   introduced at a very early period. It has a wolflike face, bushy tail,\n   and a reddish brown color.'),
(21219, 'Dingy', 'superl.', 'Soiled; sullied; of a dark or dusky color; dark brown;\n   dirty.'),
(21220, 'Dining', 'n. & a.', 'from Dine, a.'),
(21221, 'Dinmont', 'n.', 'A wether sheep between one and two years old.'),
(21222, 'Dinner', 'n.', 'The principal meal of the day, eaten by most people about\n   midday, but by many (especially in cities) at a later hour.'),
(21223, 'Dinner', 'n.', 'An entertainment; a feast.'),
(21224, 'Dinnerly', 'a.', 'Of or pertaining to dinner.'),
(21225, 'Dinornis', 'n.', 'A genus of extinct, ostrichlike birds of gigantic size,\n   which formerly inhabited New Zealand. See Moa.'),
(21226, 'Dinosaur', 'n.', 'Alt. of Dinosaurian'),
(21227, 'Dinoxide', 'n.', 'Same as Dioxide.'),
(21228, 'Dinsome', 'a.', 'Full of din.'),
(21229, 'Dinted', 'imp. & p. p.', 'of Dint'),
(21230, 'Dinting', 'p. pr. & vb. n.', 'of Dint'),
(21231, 'Diocesan', 'a.', 'Of or pertaining to a diocese; as, diocesan missions.'),
(21232, 'Diocesan', 'n.', 'A bishop, viewed in relation to his diocese; as, the\n   diocesan of New York.'),
(21233, 'Diocesan', 'n.', 'The clergy or the people of a diocese.'),
(21234, 'Dioceses', 'pl. ', 'of Diocese'),
(21235, 'Diocese', 'n.', 'The circuit or extent of a bishop\'s jurisdiction; the\n   district in which a bishop exercises his ecclesiastical authority.'),
(21236, 'Diodon', 'n.', 'A genus of spinose, plectognath fishes, having the teeth of\n   each jaw united into a single beaklike plate. They are able to inflate\n   the body by taking in air or water, and, hence, are called globefishes,\n   swellfishes, etc. Called also porcupine fishes, and sea hedgehogs.'),
(21237, 'Diodon', 'n.', 'A genus of whales.'),
(21238, 'Diodont', 'a.', 'Like or pertaining to the genus Diodon.'),
(21239, 'Diodont', 'n.', 'A fish of the genus Diodon, or an allied genus.'),
(21240, 'Dioecia', 'n. pl.', 'A Linnaean class of plants having the stamens and\n   pistils on different plants.'),
(21241, 'Dioecia', 'n. pl.', 'A subclass of gastropod mollusks in which the sexes\n   are separate. It includes most of the large marine species, like the\n   conchs, cones, and cowries.'),
(21242, 'Dioecian', 'a.', 'Alt. of Dioecious'),
(21243, 'Dioecism', 'n.', 'The condition of being dioecious.'),
(21244, 'Diogenes', 'n.', 'A Greek Cynic philosopher (412?-323 B. C.) who lived much\n   in Athens and was distinguished for contempt of the common aims and\n   conditions of life, and for sharp, caustic sayings.'),
(21245, 'Dioicous', 'a.', 'See Dioecious.'),
(21246, 'Diomedea', 'n.', 'A genus of large sea birds, including the albatross. See\n   Albatross.'),
(21247, 'Dionaea', 'n.', 'An insectivorous plant. See Venus\'s flytrap.'),
(21248, 'Diopside', 'n.', 'A crystallized variety of pyroxene, of a clear, grayish\n   green color; mussite.'),
(21249, 'Dioptase', 'n.', 'A hydrous silicate of copper, occurring in emerald-green\n   crystals.'),
(21250, 'Diopter', 'n.', 'Alt. of Dioptra'),
(21251, 'Dioptra', 'n.', 'An optical instrument, invented by Hipparchus, for taking\n   altitudes, leveling, etc.'),
(21252, 'Dioptre', 'n.', 'A unit employed by oculists in numbering glasses according\n   to the metric system; a refractive power equal to that of a glass whose\n   principal focal distance is one meter.'),
(21253, 'Dioptric', 'a.', 'Of or pertaining to the dioptre, or to the metric system\n   of numbering glasses.'),
(21254, 'Dioptric', 'n.', 'A dioptre. See Dioptre.'),
(21255, 'Dioptric', 'a.', 'Alt. of Dioptrical'),
(21256, 'Dioptry', 'n.', 'A dioptre.'),
(21257, 'Diorama', 'n.', 'A mode of scenic representation, invented by Daguerre and\n   Bouton, in which a painting is seen from a distance through a large\n   opening. By a combination of transparent and opaque painting, and of\n   transmitted and reflected light, and by contrivances such as screens\n   and shutters, much diversity of scenic effect is produced.'),
(21258, 'Diorama', 'n.', 'A building used for such an exhibition.'),
(21259, 'Dioramic', 'a.', 'Pertaining to a diorama.'),
(21260, 'Diorism', 'n.', 'Definition; logical direction.'),
(21261, 'Diorite', 'n.', 'An igneous, crystalline in structure, consisting\n   essentially of a triclinic feldspar and hornblende. It includes part of\n   what was called greenstone.'),
(21262, 'Dioritic', 'a.', 'Containing diorite.'),
(21263, 'Diota', 'n.', 'A vase or drinking cup having two handles or ears.'),
(21264, 'Dioxide', 'n.', 'An oxide containing two atoms of oxygen in each molecule;\n   binoxide.'),
(21265, 'Dioxide', 'n.', 'An oxide containing but one atom or equivalent of oxygen\n   to two of a metal; a suboxide.'),
(21266, 'Dipped', 'imp. & p. p.', 'of Dip'),
(21267, 'Dipping', 'p. pr. & vb. n.', 'of Dip'),
(21268, 'Dipchick', 'n.', 'See Dabchick.'),
(21269, 'Diphenyl', 'n.', 'A white crystalline substance, C6H5.C6H5, obtained by\n   leading benzene through a heated iron tube. It consists of two benzene\n   or phenyl radicals united.'),
(21270, 'Diplanar', 'a.', 'Of or pertaining to two planes.'),
(21271, 'Diploe', 'n.', 'The soft, spongy, or cancellated substance between the\n   plates of the skull.'),
(21272, 'Diploic', 'a.', 'Of or pertaining to the diploe.'),
(21273, 'Diploid', 'n.', 'A solid bounded by twenty-four similar quadrilateral\n   faces. It is a hemihedral form of the hexoctahedron.'),
(21274, 'Diplomas', 'pl. ', 'of Diploma'),
(21275, 'Diploma', 'n.', 'A letter or writing, usually under seal, conferring some\n   privilege, honor, or power; a document bearing record of a degree\n   conferred by a literary society or educational institution.'),
(21276, 'Diplomat', 'n.', 'Alt. of Diplomate'),
(21277, 'Diplopia', 'n.', 'Alt. of Diplopy'),
(21278, 'Diplopy', 'n.', 'The act or state of seeing double.'),
(21279, 'Diplopod', 'n.', 'One of the Diplopoda.'),
(21280, 'Dipnoi', 'n. pl.', 'A group of ganoid fishes, including the living genera\n   Ceratodus and Lepidosiren, which present the closest approximation to\n   the Amphibia. The air bladder acts as a lung, and the nostrils open\n   inside the mouth. See Ceratodus, and Illustration in Appendix.'),
(21281, 'Dipodies', 'pl. ', 'of Dipody'),
(21282, 'Dipody', 'n.', 'Two metrical feet taken together, or included in one\n   measure.'),
(21283, 'Dipolar', 'a.', 'Having two poles, as a magnetic bar.'),
(21284, 'Dipper', 'n.', 'One who, or that which, dips; especially, a vessel used to\n   dip water or other liquid; a ladle.'),
(21285, 'Dipper', 'n.', 'A small grebe; the dabchick.'),
(21286, 'Dipper', 'n.', 'The buffel duck.'),
(21287, 'Dipper', 'n.', 'The water ouzel (Cinolus aquaticus) of Europe.'),
(21288, 'Dipper', 'n.', 'The American dipper or ouzel (Cinclus Mexicanus).'),
(21289, 'Dipping', 'n.', 'The act or process of immersing.'),
(21290, 'Dipping', 'n.', 'The act of inclining downward.'),
(21291, 'Dipping', 'n.', 'The act of lifting or moving a liquid with a dipper,\n   ladle, or the like.'),
(21292, 'Dipping', 'n.', 'The process of cleaning or brightening sheet metal or\n   metalware, esp. brass, by dipping it in acids, etc.'),
(21293, 'Dipping', 'n.', 'The practice of taking snuff by rubbing the teeth or gums\n   with a stick or brush dipped in snuff.'),
(21294, 'Dipropyl', 'n.', 'One of the hexane paraffins, found in petroleum,\n   consisting of two propyl radicals. See Hexane.'),
(21295, 'Dipsas', 'n.', 'A serpent whose bite was fabled to produce intense thirst.'),
(21296, 'Dipsas', 'n.', 'A genus of harmless colubrine snakes.'),
(21297, 'Dipsetic', 'a.', 'Tending to produce thirst.'),
(21298, 'Dipsosis', 'n.', 'Excessive thirst produced by disease.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(21299, 'Diptera', 'n. pl.', 'An extensive order of insects having only two\n   functional wings and two balancers, as the house fly, mosquito, etc.\n   They have a suctorial proboscis, often including two pairs of sharp\n   organs (mandibles and maxillae) with which they pierce the skin of\n   animals. They undergo a complete metamorphosis, their larvae (called\n   maggots) being usually without feet.'),
(21300, 'Dipteral', 'a.', 'Having two wings only; belonging to the order Diptera.'),
(21301, 'Dipteral', 'a.', 'Having a double row of columns on each on the flanks, as\n   well as in front and rear; -- said of a temple.'),
(21302, 'Dipteran', 'n.', 'An insect of the order Diptera.'),
(21303, 'Diptote', 'n.', 'A noun which has only two cases.'),
(21304, 'Diptych', 'n.', 'Anything consisting of two leaves.'),
(21305, 'Diptych', 'n.', 'A writing tablet consisting of two leaves of rigid\n   material connected by hinges and shutting together so as to protect the\n   writing within.'),
(21306, 'Diptych', 'n.', 'A picture or series of pictures painted on two tablets\n   connected by hinges. See Triptych.'),
(21307, 'Diptych', 'n.', 'A double catalogue, containing in one part the names of\n   living, and in the other of deceased, ecclesiastics and benefactors of\n   the church; a catalogue of saints.'),
(21308, 'Dipyre', 'n.', 'A mineral of the scapolite group; -- so called from the\n   double effect of fire upon it, in fusing it, and rendering it\n   phosphorescent.'),
(21309, 'Direct', 'a.', 'Straight; not crooked, oblique, or circuitous; leading by\n   the short or shortest way to a point or end; as, a direct line; direct\n   means.'),
(21310, 'Direct', 'a.', 'Straightforward; not of crooked ways, or swerving from\n   truth and openness; sincere; outspoken.'),
(21311, 'Direct', 'a.', 'Immediate; express; plain; unambiguous.'),
(21312, 'Direct', 'a.', 'In the line of descent; not collateral; as, a descendant in\n   the direct line.'),
(21313, 'Direct', 'a.', 'In the direction of the general planetary motion, or from\n   west to east; in the order of the signs; not retrograde; -- said of the\n   motion of a celestial body.'),
(21314, 'Directed', 'imp. & p. p.', 'of Direct'),
(21315, 'Direct', 'v. t.', 'To arrange in a direct or straight line, as against a\n   mark, or towards a goal; to point; to aim; as, to direct an arrow or a\n   piece of ordnance.'),
(21316, 'Direct', 'v. t.', 'To point out or show to (any one), as the direct or\n   right course or way; to guide, as by pointing out the way; as, he\n   directed me to the left-hand road.'),
(21317, 'Direct', 'v. t.', 'To determine the direction or course of; to cause to go\n   on in a particular manner; to order in the way to a certain end; to\n   regulate; to govern; as, to direct the affairs of a nation or the\n   movements of an army.'),
(21318, 'Direct', 'v. t.', 'To point out to with authority; to instruct as a\n   superior; to order; as, he directed them to go.'),
(21319, 'Direct', 'v. t.', 'To put a direction or address upon; to mark with the\n   name and residence of the person to whom anything is sent; to\n   superscribe; as, to direct a letter.'),
(21320, 'Direct', 'v. i.', 'To give direction; to point out a course; to act as\n   guide.'),
(21321, 'Direct', 'n.', 'A character, thus [/], placed at the end of a staff on the\n   line or space of the first note of the next staff, to apprise the\n   performer of its situation.'),
(21322, 'Directer', 'n.', 'One who directs; a director.'),
(21323, 'Directly', 'adv.', 'In a direct manner; in a straight line or course.'),
(21324, 'Directly', 'adv.', 'In a straightforward way; without anything intervening;\n   not by secondary, but by direct, means.'),
(21325, 'Directly', 'adv.', 'Without circumlocution or ambiguity; absolutely; in\n   express terms.'),
(21326, 'Directly', 'adv.', 'Exactly; just.'),
(21327, 'Directly', 'adv.', 'Straightforwardly; honestly.'),
(21328, 'Directly', 'adv.', 'Manifestly; openly.'),
(21329, 'Directly', 'adv.', 'Straightway; next in order; without delay; immediately.'),
(21330, 'Directly', 'adv.', 'Immediately after; as soon as.'),
(21331, 'Director', 'n.', 'One who, or that which, directs; one who regulates,\n   guides, or orders; a manager or superintendent.'),
(21332, 'Director', 'n.', 'One of a body of persons appointed to manage the affairs\n   of a company or corporation; as, the directors of a bank, insurance\n   company, or railroad company.'),
(21333, 'Director', 'n.', 'A part of a machine or instrument which directs its\n   motion or action.'),
(21334, 'Director', 'n.', 'A slender grooved instrument upon which a knife is made\n   to slide when it is wished to limit the extent of motion of the latter,\n   or prevent its injuring the parts beneath.'),
(21335, 'Direful', 'a.', 'Dire; dreadful; terrible; calamitous; woeful; as, a\n   direful fiend; a direful day.'),
(21336, 'Direly', 'adv.', 'In a dire manner.'),
(21337, 'Dirempt', 'a.', 'Divided; separated.'),
(21338, 'Dirempt', 'v. t.', 'To separate by force; to tear apart.'),
(21339, 'Direness', 'n.', 'Terribleness; horror; woefulness.'),
(21340, 'Dirge', 'a.', 'A piece of music of a mournful character, to accompany\n   funeral rites; a funeral hymn.'),
(21341, 'Dirgeful', 'a.', 'Funereal; moaning.'),
(21342, 'Dirige', 'n.', 'A service for the dead, in the Roman Catholic Church, being\n   the first antiphon of Matins for the dead, of which Dirige is the first\n   word; a dirge.'),
(21343, 'Dirigent', 'a.', 'Directing.'),
(21344, 'Dirigent', 'n.', 'The line of motion along which a describent line or\n   surface is carried in the genesis of any plane or solid figure; a\n   directrix.'),
(21345, 'Diriment', 'a.', 'Absolute.'),
(21346, 'Dirked', 'imp. & p. p.', 'of Dirk'),
(21347, 'Dirking', 'p. pr. & vb. n.', 'of Dirk'),
(21348, 'Dirkness', 'n.', 'Darkness.'),
(21349, 'Dirtily', 'adv.', 'In a dirty manner; foully; nastily; filthily; meanly;\n   sordidly.'),
(21350, 'Dirty', 'superl.', 'Defiled with dirt; foul; nasty; filthy; not clean or\n   pure; serving to defile; as, dirty hands; dirty water; a dirty white.'),
(21351, 'Dirty', 'superl.', 'Sullied; clouded; -- applied to color.'),
(21352, 'Dirty', 'superl.', 'Sordid; base; groveling; as, a dirty fellow.'),
(21353, 'Dirty', 'superl.', 'Sleety; gusty; stormy; as, dirty weather.'),
(21354, 'Dirtied', 'imp. & p. p.', 'of Dirty'),
(21355, 'Dirtying', 'p. pr. & vb. n.', 'of Dirty'),
(21356, 'Dirty', 'v. t.', 'To foul; to make filthy; to soil; as, to dirty the\n   clothes or hands.'),
(21357, 'Dirty', 'v. t.', 'To tarnish; to sully; to scandalize; -- said of\n   reputation, character, etc.'),
(21358, 'Disable', 'a.', 'Lacking ability; unable.'),
(21359, 'Disabled', 'imp. & p. p.', 'of Disable'),
(21360, 'Disable', 'v. t.', 'To render unable or incapable; to destroy the force,\n   vigor, or power of action of; to deprive of competent physical or\n   intellectual power; to incapacitate; to disqualify; to make incompetent\n   or unfit for service; to impair.'),
(21361, 'Disable', 'v. t.', 'To deprive of legal right or qualification; to render\n   legally incapable.'),
(21362, 'Disable', 'v. t.', 'To deprive of that which gives value or estimation; to\n   declare lacking in competency; to disparage; to undervalue.'),
(21363, 'Disabuse', 'v. t.', 'To set free from mistakes; to undeceive; to disengage\n   from fallacy or deception; to set right.'),
(21364, 'Disacryl', 'n.', 'A white amorphous substance obtained as a polymeric\n   modification of acrolein.'),
(21365, 'Disadorn', 'v. t.', 'To deprive of ornaments.'),
(21366, 'Disagree', 'v. i.', 'To fail to accord; not to agree; to lack harmony; to\n   differ; to be unlike; to be at variance.'),
(21367, 'Disagree', 'v. i.', 'To differ in opinion; to hold discordant views; to be\n   at controversy; to quarrel.'),
(21368, 'Disagree', 'v. i.', 'To be unsuited; to have unfitness; as, medicine\n   sometimes disagrees with the patient; food often disagrees with the\n   stomach or the taste.'),
(21369, 'Disallow', 'v. t.', 'To refuse to allow; to deny the force or validity of;\n   to disown and reject; as, the judge disallowed the executor\'s charge.'),
(21370, 'Disally', 'v. t.', 'To part, as an alliance; to sunder.'),
(21371, 'Disannex', 'v. t.', 'To disunite; to undo or repeal the annexation of.'),
(21372, 'Disannul', 'v. t.', 'To annul completely; to render void or of no effect.'),
(21373, 'Disard', 'n.', 'See Dizzard.'),
(21374, 'Disarm', 'v. t.', 'To deprive of arms; to take away the weapons of; to\n   deprive of the means of attack or defense; to render defenseless.'),
(21375, 'Disarm', 'v. t.', 'To deprive of the means or the disposition to harm; to\n   render harmless or innocuous; as, to disarm a man\'s wrath.'),
(21376, 'Disarmed', 'a.', 'Deprived of arms.'),
(21377, 'Disarmed', 'a.', 'Deprived of claws, and teeth or beaks.'),
(21378, 'Disarmer', 'n.', 'One who disarms.'),
(21379, 'Disarray', 'v. t.', 'To throw into disorder; to break the array of.'),
(21380, 'Disarray', 'v. t.', 'To take off the dress of; to unrobe.'),
(21381, 'Disarray', 'n.', 'Want of array or regular order; disorder; confusion.'),
(21382, 'Disarray', 'n.', 'Confused attire; undress.'),
(21383, 'Disaster', 'n.', 'An unpropitious or baleful aspect of a planet or star;\n   malevolent influence of a heavenly body; hence, an ill portent.'),
(21384, 'Disaster', 'n.', 'An adverse or unfortunate event, esp. a sudden and\n   extraordinary misfortune; a calamity; a serious mishap.'),
(21385, 'Disaster', 'v. t.', 'To blast by the influence of a baleful star.'),
(21386, 'Disaster', 'v. t.', 'To bring harm upon; to injure.'),
(21387, 'Disavow', 'v. t.', 'To refuse strongly and solemnly to own or acknowledge;\n   to deny responsibility for, approbation of, and the like; to disclaim;\n   to disown; as, he was charged with embezzlement, but he disavows the\n   crime.'),
(21388, 'Disavow', 'v. t.', 'To deny; to show the contrary of; to disprove.'),
(21389, 'Disband', 'v. t.', 'To loose the bands of; to set free; to disunite; to\n   scatter; to disperse; to break up the organization of; especially, to\n   dismiss from military service; as, to disband an army.'),
(21390, 'Disband', 'v. t.', 'To divorce.'),
(21391, 'Disband', 'v. i.', 'To become separated, broken up, dissolved, or\n   scattered; especially, to quit military service by breaking up\n   organization.'),
(21392, 'Disbar', 'v. t.', 'To expel from the bar, or the legal profession; to\n   deprive (an attorney, barrister, or counselor) of his status and\n   privileges as such.'),
(21393, 'Disbark', 'v. t.', 'To disembark.'),
(21394, 'Disbark', 'v. t.', 'To strip of bark; to bark.'),
(21395, 'Disbase', 'v. t.', 'To debase or degrade.'),
(21396, 'Disbench', 'v. t.', 'To drive from a bench or seat.'),
(21397, 'Disbench', 'v. t.', 'To deprive (a bencher) of his privileges.'),
(21398, 'Disbend', 'v. t.', 'To unbend.'),
(21399, 'Disbind', 'v. t.', 'To unbind; to loosen.'),
(21400, 'Disblame', 'v. t.', 'To clear from blame.'),
(21401, 'Disbowel', 'v. t.', 'To disembowel.'),
(21402, 'Disbud', 'v.', 'To deprive of buds or shoots, as for training, or\n   economizing the vital strength of a tree.'),
(21403, 'Disburse', 'v. t.', 'To pay out; to expend; -- usually from a public fund\n   or treasury.'),
