(21632, 'Dismount', 'v. t.', 'To throw or remove from a horse; to unhorse; as, the\n   soldier dismounted his adversary.'),
(21633, 'Dismount', 'v. t.', 'To take down, or apart, as a machine.'),
(21634, 'Dismount', 'v. t.', 'To throw or remove from the carriage, or from that on\n   which a thing is mounted; to break the carriage or wheels of, and\n   render useless; to deprive of equipments or mountings; -- said esp. of\n   artillery.'),
(21635, 'Disobey', 'v. t.', 'Not to obey; to neglect or refuse to obey (a superior\n   or his commands, the laws, etc.); to transgress the commands of (one in\n   authority); to violate, as an order; as, refractory children disobey\n   their parents; men disobey their Maker and the laws.'),
(21636, 'Disobey', 'v. i.', 'To refuse or neglect to obey; to violate commands; to\n   be disobedient.'),
(21637, 'Disorb', 'v. t.', 'To throw out of the proper orbit; to unsphere.'),
(21638, 'Disord', 'n.', 'Disorder.'),
(21639, 'Disorder', 'n.', 'Want of order or regular disposition; lack of\n   arrangement; confusion; disarray; as, the troops were thrown into\n   disorder; the papers are in disorder.'),
(21640, 'Disorder', 'n.', 'Neglect of order or system; irregularity.'),
(21641, 'Disorder', 'n.', 'Breach of public order; disturbance of the peace of\n   society; tumult.'),
(21642, 'Disorder', 'n.', 'Disturbance of the functions of the animal economy of the\n   soul; sickness; derangement.'),
(21643, 'Disorder', 'v. t.', 'To disturb the order of; to derange or disarrange; to\n   throw into confusion; to confuse.'),
(21644, 'Disorder', 'v. t.', 'To disturb or interrupt the regular and natural\n   functions of (either body or mind); to produce sickness or\n   indisposition in; to discompose; to derange; as, to disorder the head\n   or stomach.'),
(21645, 'Disorder', 'v. t.', 'To depose from holy orders.'),
(21646, 'Disowned', 'imp. & p. p.', 'of Disown'),
(21647, 'Disown', 'v. t.', 'To refuse to own or acknowledge as belonging to one\'s\n   self; to disavow or deny, as connected with one\'s self personally; as,\n   a parent can hardly disown his child; an author will sometimes disown\n   his writings.'),
(21648, 'Disown', 'v. t.', 'To refuse to acknowledge or allow; to deny.'),
(21649, 'Dispace', 'v. i.', 'To roam.'),
(21650, 'Dispair', 'v. t.', 'To separate (a pair).'),
(21651, 'Dispand', 'v. t.', 'To spread out; to expand.'),
(21652, 'Dispark', 'v. t.', 'To throw (a park or inclosure); to treat (a private\n   park) as a common.'),
(21653, 'Dispark', 'v. t.', 'To set at large; to release from inclosure.'),
(21654, 'Dispart', 'v. t.', 'To part asunder; to divide; to separate; to sever; to\n   rend; to rive or split; as, disparted air; disparted towers.'),
(21655, 'Dispart', 'v. i.', 'To separate, to open; to cleave.'),
(21656, 'Dispart', 'n.', 'The difference between the thickness of the metal at the\n   mouth and at the breech of a piece of ordnance.'),
(21657, 'Dispart', 'n.', 'A piece of metal placed on the muzzle, or near the\n   trunnions, on the top of a piece of ordnance, to make the line of sight\n   parallel to the axis of the bore; -- called also dispart sight, and\n   muzzle sight.'),
(21658, 'Dispart', 'v. t.', 'To make allowance for the dispart in (a gun), when\n   taking aim.'),
(21659, 'Dispart', 'v. t.', 'To furnish with a dispart sight.'),
(21660, 'Dispatch', 'v. t.', 'To dispose of speedily, as business; to execute\n   quickly; to make a speedy end of; to finish; to perform.'),
(21661, 'Dispatch', 'v. t.', 'To rid; to free.'),
(21662, 'Dispatch', 'v. t.', 'To get rid of by sending off; to send away hastily.'),
(21663, 'Dispatch', 'v. t.', 'To send off or away; -- particularly applied to\n   sending off messengers, messages, letters, etc., on special business,\n   and implying haste.'),
(21664, 'Dispatch', 'v. t.', 'To send out of the world; to put to death.'),
(21665, 'Dispatch', 'v. i.', 'To make haste; to conclude an affair; to finish a\n   matter of business.'),
(21666, 'Dispatch', 'v. t.', 'The act of sending a message or messenger in haste or\n   on important business.'),
(21667, 'Dispatch', 'v. t.', 'Any sending away; dismissal; riddance.'),
(21668, 'Dispatch', 'v. t.', 'The finishing up of a business; speedy performance, as\n   of business; prompt execution; diligence; haste.'),
(21669, 'Dispatch', 'v. t.', 'A message dispatched or sent with speed; especially,\n   an important official letter sent from one public officer to another;\n   -- often used in the plural; as, a messenger has arrived with\n   dispatches for the American minister; naval or military dispatches.'),
(21670, 'Dispatch', 'v. t.', 'A message transmitted by telegraph.'),
(21671, 'Dispathy', 'n.', 'Lack of sympathy; want of passion; apathy.'),
(21672, 'Dispeed', 'v. t.', 'To send off with speed; to dispatch.'),
(21673, 'Dispel', 'v. t.', 'To drive away by scattering, or so to cause to vanish;\n   to clear away; to banish; to dissipate; as, to dispel a cloud, vapors,\n   cares, doubts, illusions.'),
(21674, 'Dispence', 'v. i. & n.', 'See Dispense.'),
(21675, 'Dispend', 'v. t.', 'To spend; to lay out; to expend.'),
(21676, 'Dispense', 'v. t.', 'To deal out in portions; to distribute; to give; as,\n   the steward dispenses provisions according directions; Nature dispenses\n   her bounties; to dispense medicines.'),
(21677, 'Dispense', 'v. t.', 'To apply, as laws to particular cases; to administer;\n   to execute; to manage; to direct.'),
(21678, 'Dispense', 'v. t.', 'To pay for; to atone for.'),
(21679, 'Dispense', 'v. t.', 'To exempt; to excuse; to absolve; -- with from.'),
(21680, 'Dispense', 'v. i.', 'To compensate; to make up; to make amends.'),
(21681, 'Dispense', 'v. i.', 'To give dispensation.'),
(21682, 'Dispense', 'v. t.', 'Dispensation; exemption.'),
(21683, 'Dispense', 'n.', 'Expense; profusion; outlay.'),
(21684, 'Disperge', 'v. t.', 'To sprinkle.'),
(21685, 'Disperse', 'v. t.', 'To scatter abroad; to drive to different parts; to\n   distribute; to diffuse; to spread; as, the Jews are dispersed among all\n   nations.'),
(21686, 'Disperse', 'v. t.', 'To scatter, so as to cause to vanish; to dissipate;\n   as, to disperse vapors.'),
(21687, 'Disperse', 'v. i.', 'To separate; to go or move into different parts; to\n   vanish; as, the company dispersed at ten o\'clock; the clouds disperse.'),
(21688, 'Disperse', 'v. i.', 'To distribute wealth; to share one\'s abundance with\n   others.'),
(21689, 'Dispirit', 'v. t.', 'To deprive of cheerful spirits; to depress the spirits\n   of; to dishearten; to discourage.'),
(21690, 'Dispirit', 'v. t.', 'To distill or infuse the spirit of.'),
(21691, 'Displace', 'v. t.', 'To change the place of; to remove from the usual or\n   proper place; to put out of place; to place in another situation; as,\n   the books in the library are all displaced.'),
(21692, 'Displace', 'v. t.', 'To crowd out; to take the place of.'),
(21693, 'Displace', 'v. t.', 'To remove from a state, office, dignity, or\n   employment; to discharge; to depose; as, to displace an officer of the\n   revenue.'),
(21694, 'Displace', 'v. t.', 'To dislodge; to drive away; to banish.'),
(21695, 'Displant', 'v. t.', 'To remove (what is planted or fixed); to unsettle and\n   take away; to displace; to root out; as, to displant inhabitants.'),
(21696, 'Displant', 'v. t.', 'To strip of what is planted or settled; as, to\n   displant a country of inhabitants.'),
(21697, 'Displat', 'v. t.', 'To untwist; to uncurl; to unplat.'),
(21698, 'Display', 'v. t.', 'To unfold; to spread wide; to expand; to stretch out;\n   to spread.'),
(21699, 'Display', 'v. t.', 'To extend the front of (a column), bringing it into\n   line.'),
(21700, 'Display', 'v. t.', 'To spread before the view; to show; to exhibit to the\n   sight, or to the mind; to make manifest.'),
(21701, 'Display', 'v. t.', 'To make an exhibition of; to set in view conspicuously\n   or ostentatiously; to exhibit for the sake of publicity; to parade.'),
(21702, 'Display', 'v. t.', 'To make conspicuous by large or prominent type.'),
(21703, 'Display', 'v. t.', 'To discover; to descry.'),
(21704, 'Display', 'v. i.', 'To make a display; to act as one making a show or\n   demonstration.'),
(21705, 'Display', 'n.', 'An opening or unfolding; exhibition; manifestation.'),
(21706, 'Display', 'n.', 'Ostentatious show; exhibition for effect; parade.'),
(21707, 'Disple', 'v. t.', 'To discipline; to correct.'),
(21708, 'Displode', 'v. t.', 'To discharge; to explode.'),
(21709, 'Displode', 'v. i.', 'To burst with a loud report; to explode.'),
(21710, 'Displume', 'v. t.', 'To strip of, or as of, a plume, or plumes; to deprive\n   of decoration; to dishonor; to degrade.'),
(21711, 'Dispond', 'n.', 'See Despond.'),
(21712, 'Dispone', 'v. t.', 'To dispose.'),
(21713, 'Dispone', 'v. t.', 'To dispose of.'),
(21714, 'Dispone', 'v. t.', 'To make over, or convey, legally.'),
(21715, 'Disponee', 'n.', 'The person to whom any property is legally conveyed.'),
(21716, 'Disponer', 'n.', 'One who legally transfers property from himself to\n   another.'),
(21717, 'Disponge', 'v. t.', 'To sprinkle, as with water from a sponge.'),
(21718, 'Dispope', 'v. t.', 'To refuse to consider as pope; to depose from the\n   popedom.'),
(21719, 'Disport', 'v. i.', 'Play; sport; pastime; diversion; playfulness.'),
(21720, 'Disport', 'v. i.', 'To play; to wanton; to move in gayety; to move lightly\n   and without restraint; to amuse one\'s self.'),
(21721, 'Disport', 'v. i.', 'To divert or amuse; to make merry.'),
(21722, 'Disport', 'v. i.', 'To remove from a port; to carry away.'),
(21723, 'Disposal', 'n.', 'The act of disposing, or disposing of, anything;\n   arrangement; orderly distribution; a putting in order; as, the disposal\n   of the troops in two lines.'),
(21724, 'Disposal', 'n.', 'Ordering; regulation; adjustment; management; government;\n   direction.'),
(21725, 'Disposal', 'n.', 'Regulation of the fate, condition, application, etc., of\n   anything; the transference of anything into new hands, a new place,\n   condition, etc.; alienation, or parting; as, a disposal of property.'),
(21726, 'Disposal', 'n.', 'Power or authority to dispose of, determine the condition\n   of, control, etc., especially in the phrase at, or in, the disposal of.'),
(21727, 'Disposed', 'imp. & p. p.', 'of Dispose'),
(21728, 'Dispose', 'v. t.', 'To distribute and put in place; to arrange; to set in\n   order; as, to dispose the ships in the form of a crescent.'),
(21729, 'Dispose', 'v. t.', 'To regulate; to adjust; to settle; to determine.'),
(21730, 'Dispose', 'v. t.', 'To deal out; to assign to a use; to bestow for an\n   object or purpose; to apply; to employ; to dispose of.'),
(21731, 'Dispose', 'v. t.', 'To give a tendency or inclination to; to adapt; to\n   cause to turn; especially, to incline the mind of; to give a bent or\n   propension to; to incline; to make inclined; -- usually followed by to,\n   sometimes by for before the indirect object.'),
(21732, 'Dispose', 'v. t.', 'To exercise finally one\'s power of control over; to\n   pass over into the control of some one else, as by selling; to\n   alienate; to part with; to relinquish; to get rid of; as, to dispose of\n   a house; to dispose of one\'s time.'),
(21733, 'Dispose', 'v. i.', 'To bargain; to make terms.'),
(21734, 'Dispose', 'n.', 'Disposal; ordering; management; power or right of control.'),
(21735, 'Dispose', 'n.', 'Cast of mind; disposition; inclination; behavior;\n   demeanor.'),
(21736, 'Disposed', 'p. a.', 'Inclined; minded.'),
(21737, 'Disposed', 'p. a.', 'Inclined to mirth; jolly.'),
(21738, 'Disposer', 'n.', 'One who, or that which, disposes; a regulator; a\n   director; a bestower.'),
(21739, 'Dispost', 'v. t.', 'To eject from a post; to displace.'),
(21740, 'Dispread', 'v. t.', 'To spread abroad, or different ways; to spread apart;\n   to open; as, the sun dispreads his beams.'),
(21741, 'Dispread', 'v. i.', 'To extend or expand itself.'),
(21742, 'Disprize', 'v. t.', 'To depreciate.'),
(21743, 'Disproof', 'n.', 'A proving to be false or erroneous; confutation;\n   refutation; as, to offer evidence in disproof of a statement.'),
(21744, 'Disprove', 'v. t.', 'To prove to be false or erroneous; to confute; to\n   refute.'),
(21745, 'Disprove', 'v. t.', 'To disallow; to disapprove of.'),
(21746, 'Dispunct', 'a.', 'Wanting in punctilious respect; discourteous.'),
(21747, 'Dispunct', 'v. t.', 'To expunge.'),
(21748, 'Dispunge', 'v. t.', 'To expunge; to erase.'),
(21749, 'Dispunge', 'v. t.', 'See Disponge.'),
(21750, 'Dispurse', 'v. t.', 'To disburse.'),
(21751, 'Disputed', 'imp. & p. p.', 'of Dispute'),
(21752, 'Dispute', 'v. i.', 'To contend in argument; to argue against something\n   maintained, upheld, or claimed, by another; to discuss; to reason; to\n   debate; to altercate; to wrangle.'),
(21753, 'Dispute', 'v. t.', 'To make a subject of disputation; to argue pro and con;\n   to discuss.'),
(21754, 'Dispute', 'v. t.', 'To oppose by argument or assertion; to attempt to\n   overthrow; to controvert; to express dissent or opposition to; to call\n   in question; to deny the truth or validity of; as, to dispute\n   assertions or arguments.'),
(21755, 'Dispute', 'v. t.', 'To strive or contend about; to contest.'),
(21756, 'Dispute', 'v. t.', 'To struggle against; to resist.'),
(21757, 'Dispute', 'v. i.', 'Verbal controversy; contest by opposing argument or\n   expression of opposing views or claims; controversial discussion;\n   altercation; debate.'),
(21758, 'Dispute', 'v. i.', 'Contest; struggle; quarrel.'),
(21759, 'Disputer', 'n.', 'One who disputes, or who is given to disputes; a\n   controvertist.'),
(21760, 'Disquiet', 'a.', 'Deprived of quiet; impatient; restless; uneasy.'),
(21761, 'Disquiet', 'n.', 'Want of quiet; want of tranquility in body or mind;\n   uneasiness; restlessness; disturbance; anxiety.'),
(21762, 'Disquiet', 'v. t.', 'To render unquiet; to deprive of peace, rest, or\n   tranquility; to make uneasy or restless; to disturb.'),
(21763, 'Disrange', 'v. t.', 'To disarrange.'),
(21764, 'Disrank', 'v. t.', 'To degrade from rank.'),
(21765, 'Disrank', 'v. t.', 'To throw out of rank or into confusion.'),
(21766, 'Disrate', 'v. t.', 'To reduce to a lower rating or rank; to degrade.'),
(21767, 'Disray', 'variant', 'of Disarray.'),
(21768, 'Disrobed', 'imp. & p. p.', 'of Disrobe'),
(21769, 'Disrobe', 'v. t. & i.', 'To divest of a robe; to undress; figuratively, to\n   strip of covering; to divest of that which clothes or decorates; as,\n   autumn disrobes the fields of verdure.'),
(21770, 'Disrober', 'n.', 'One who, or that which, disrobes.'),
(21771, 'Disroof', 'v. t.', 'To unroof.'),
(21772, 'Disroot', 'v. t.', 'To tear up the roots of, or by the roots; hence, to\n   tear from a foundation; to uproot.'),
(21773, 'Disrout', 'v. i.', 'To put to rout.'),
(21774, 'Disruly', 'a.', 'Unruly; disorderly.'),
(21775, 'Disrupt', 'a.', 'Rent off; torn asunder; severed; disrupted.'),
(21776, 'Disrupt', 'v. t.', 'To break asunder; to rend.'),
(21777, 'Disseat', 'v. t.', 'To unseat.'),
(21778, 'Dissect', 'v. t.', 'To divide into separate parts; to cut in pieces; to\n   separate and expose the parts of, as an animal or a plant, for\n   examination and to show their structure and relations; to anatomize.'),
(21779, 'Dissect', 'v. t.', 'To analyze, for the purposes of science or criticism;\n   to divide and examine minutely.'),
(21780, 'Disseize', 'v. t.', 'To deprive of seizin or possession; to dispossess or\n   oust wrongfully (one in freehold possession of land); -- followed by\n   of; as, to disseize a tenant of his freehold.'),
(21781, 'Dissent', 'v. i.', 'To differ in opinion; to be of unlike or contrary\n   sentiment; to disagree; -- followed by from.'),
(21782, 'Dissent', 'v. i.', 'To differ from an established church in regard to\n   doctrines, rites, or government.'),
(21783, 'Dissent', 'v. i.', 'To differ; to be of a contrary nature.'),
(21784, 'Dissent', 'n.', 'The act of dissenting; difference of opinion; refusal to\n   adopt something proposed; nonagreement, nonconcurrence, or\n   disagreement.'),
(21785, 'Dissent', 'n.', 'Separation from an established church, especially that of\n   England; nonconformity.'),
(21786, 'Dissent', 'n.', 'Contrariety of nature; diversity in quality.'),
(21787, 'Dissert', 'v. i.', 'To discourse or dispute; to discuss.'),
(21788, 'Di/////', 'imp. & p. p.', 'of Disserve'),
(21789, 'Disserve', 'v. t.', 'To fail to serve; to do injury or mischief to; to\n   damage; to hurt; to harm.'),
(21790, 'Dissever', 'v. t.', 'To part in two; to sever thoroughly; to sunder; to\n   disunite; to separate; to disperse.'),
(21791, 'Dissever', 'v. i.', 'To part; to separate.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(21792, 'Disship', 'v. t.', 'To dismiss from service on board ship.'),
(21793, 'Dissite', 'a.', 'Lying apart.'),
(21794, 'Dissolve', 'v. t.', 'To separate into competent parts; to disorganize; to\n   break up; hence, to bring to an end by separating the parts, sundering\n   a relation, etc.; to terminate; to destroy; to deprive of force; as, to\n   dissolve a partnership; to dissolve Parliament.'),
(21795, 'Dissolve', 'v. t.', 'To break the continuity of; to disconnect; to\n   disunite; to sunder; to loosen; to undo; to separate.'),
(21796, 'Dissolve', 'v. t.', 'To convert into a liquid by means of heat, moisture,\n   etc.,; to melt; to liquefy; to soften.'),
(21797, 'Dissolve', 'v. t.', 'To solve; to clear up; to resolve.'),
(21798, 'Dissolve', 'v. t.', 'To relax by pleasure; to make powerless.'),
(21799, 'Dissolve', 'v. t.', 'To annul; to rescind; to discharge or release; as, to\n   dissolve an injunction.'),
(21800, 'Dissolve', 'v. i.', 'To waste away; to be dissipated; to be decomposed or\n   broken up.'),
(21801, 'Dissolve', 'v. i.', 'To become fluid; to be melted; to be liquefied.'),
(21802, 'Dissolve', 'v. i.', 'To fade away; to fall to nothing; to lose power.'),
(21803, 'Dissuade', 'v. t.', 'To advise or exhort against; to try to persuade (one\n   from a course).'),
(21804, 'Dissuade', 'v. t.', 'To divert by persuasion; to turn from a purpose by\n   reasons or motives; -- with from; as, I could not dissuade him from his\n   purpose.'),
(21805, 'Distad', 'adv.', 'Toward a distal part; on the distal side of; distally.'),
(21806, 'Distaffs', 'pl. ', 'of Distaff'),
(21807, 'Distaves', 'pl. ', 'of Distaff'),
(21808, 'Distaff', 'n.', 'The staff for holding a bunch of flax, tow, or wool, from\n   which the thread is drawn in spinning by hand.'),
(21809, 'Distaff', 'n.', 'Used as a symbol of the holder of a distaff; hence, a\n   woman; women, collectively.'),
(21810, 'Distain', 'v. t.', 'To tinge with a different color from the natural or\n   proper one; to stain; to discolor; to sully; to tarnish; to defile; --\n   used chiefly in poetry.'),
(21811, 'Distal', 'a.', 'Remote from the point of attachment or origin; as, the\n   distal end of a bone or muscle'),
(21812, 'Distal', 'a.', 'Pertaining to that which is distal; as, the distal\n   tuberosities of a bone.'),
(21813, 'Distally', 'adv.', 'Toward a distal part.'),
(21814, 'Distance', 'n.', 'The space between two objects; the length of a line,\n   especially the shortest line joining two points or things that are\n   separate; measure of separation in place.'),
(21815, 'Distance', 'n.', 'Remoteness of place; a remote place.'),
(21816, 'Distance', 'n.', 'A space marked out in the last part of a race course.'),
(21817, 'Distance', 'n.', 'Relative space, between troops in ranks, measured from\n   front to rear; -- contrasted with interval, which is measured from\n   right to left.'),
(21818, 'Distance', 'n.', 'Space between two antagonists in fencing.'),
(21819, 'Distance', 'n.', 'The part of a picture which contains the representation\n   of those objects which are the farthest away, esp. in a landscape.'),
(21820, 'Distance', 'n.', 'Ideal disjunction; discrepancy; contrariety.'),
(21821, 'Distance', 'n.', 'Length or interval of time; period, past or future,\n   between two eras or events.'),
(21822, 'Distance', 'n.', 'The remoteness or reserve which respect requires; hence,\n   respect; ceremoniousness.'),
(21823, 'Distance', 'n.', 'A withholding of intimacy; alienation; coldness;\n   disagreement; variance; restraint; reserve.'),
(21824, 'Distance', 'n.', 'Remoteness in succession or relation; as, the distance\n   between a descendant and his ancestor.'),
(21825, 'Distance', 'n.', 'The interval between two notes; as, the distance of a\n   fourth or seventh.'),
(21826, 'Distance', 'v. t.', 'To place at a distance or remotely.'),
(21827, 'Distance', 'v. t.', 'To cause to appear as if at a distance; to make seem\n   remote.'),
(21828, 'Distance', 'v. t.', 'To outstrip by as much as a distance (see Distance,\n   n., 3); to leave far behind; to surpass greatly.'),
(21829, 'Distancy', 'n.', 'Distance.'),
(21830, 'Distant', 'a.', 'Separated; having an intervening space; at a distance;\n   away.'),
(21831, 'Distant', 'a.', 'Far separated; far off; not near; remote; -- in place,\n   time, consanguinity, or connection; as, distant times; distant\n   relatives.'),
(21832, 'Distant', 'a.', 'Reserved or repelling in manners; cold; not cordial;\n   somewhat haughty; as, a distant manner.'),
(21833, 'Distant', 'a.', 'Indistinct; faint; obscure, as from distance.'),
(21834, 'Distant', 'a.', 'Not conformable; discrepant; repugnant; as, a practice so\n   widely distant from Christianity.'),
(21835, 'Distaste', 'n.', 'Aversion of the taste; dislike, as of food or drink;\n   disrelish.'),
(21836, 'Distaste', 'n.', 'Discomfort; uneasiness.'),
(21837, 'Distaste', 'n.', 'Alienation of affection; displeasure; anger.'),
(21838, 'Distaste', 'v. t.', 'Not to have relish or taste for; to disrelish; to\n   loathe; to dislike.'),
(21839, 'Distaste', 'v. t.', 'To offend; to disgust; to displease.'),
(21840, 'Distaste', 'v. t.', 'To deprive of taste or relish; to make unsavory or\n   distasteful.'),
(21841, 'Distaste', 'v. i.', 'To be distasteful; to taste ill or disagreeable.'),
(21842, 'Distend', 'v. t.', 'To extend in some one direction; to lengthen out; to\n   stretch.'),
(21843, 'Distend', 'v. t.', 'To stretch out or extend in all directions; to dilate;\n   to enlarge, as by elasticity of parts; to inflate so as to produce\n   tension; to cause to swell; as, to distend a bladder, the stomach, etc.'),
(21844, 'Distend', 'v. i.', 'To become expanded or inflated; to swell.'),
(21845, 'Distent', 'a.', 'Distended.'),
(21846, 'Distent', 'n.', 'Breadth.'),
(21847, 'Dister', 'v. t.', 'To banish or drive from a country.'),
(21848, 'Disthene', 'n.', 'Cyanite or kyanite; -- so called in allusion to its\n   unequal hardness in two different directions. See Cyanite.'),
(21849, 'Distich', 'n.', 'A couple of verses or poetic lines making complete sense;\n   an epigram of two verses.'),
(21850, 'Distich', 'n.', 'Alt. of Distichous'),
(21851, 'Distil', 'v. t. & i.', 'See Distill.'),
(21852, 'Distill', 'n. & v', 'To drop; to fall in drops; to trickle.'),
(21853, 'Distill', 'n. & v', 'To flow gently, or in a small stream.'),
(21854, 'Distill', 'n. & v', 'To practice the art of distillation.'),
(21855, 'Distill', 'v. t.', 'To let fall or send down in drops.'),
(21856, 'Distill', 'v. t.', 'To obtain by distillation; to extract by distillation,\n   as spirits, essential oil, etc.; to rectify; as, to distill brandy from\n   wine; to distill alcoholic spirits from grain; to distill essential\n   oils from flowers, etc.; to distill fresh water from sea water.'),
(21857, 'Distill', 'v. t.', 'To subject to distillation; as, to distill molasses in\n   making rum; to distill barley, rye, corn, etc.'),
(21858, 'Distill', 'v. t.', 'To dissolve or melt.'),
(21859, 'Distinct', 'a.', 'Distinguished; having the difference marked; separated by\n   a visible sign; marked out; specified.'),
(21860, 'Distinct', 'a.', 'Marked; variegated.'),
