(21899, 'Distrust', 'n.', 'Suspicion of evil designs.'),
(21900, 'Distrust', 'n.', 'State of being suspected; loss of trust.'),
(21901, 'Distune', 'v. t.', 'To put out of tune.'),
(21902, 'Disturb', 'v. t.', 'To throw into disorder or confusion; to derange; to\n   interrupt the settled state of; to excite from a state of rest.'),
