(21929, 'Ditation', 'n.', 'The act of making rich; enrichment.'),
(21930, 'Ditches', 'pl. ', 'of Ditch'),
(21931, 'Ditch', 'n.', 'A trench made in the earth by digging, particularly a trench\n   for draining wet land, for guarding or fencing inclosures, or for\n   preventing an approach to a town or fortress. In the latter sense, it\n   is called also a moat or a fosse.'),
