(22087, 'Divorce', 'n.', 'The decree or writing by which marriage is dissolved.'),
(22088, 'Divorce', 'n.', 'Separation; disunion of things closely united.'),
(22089, 'Divorce', 'n.', 'That which separates.'),
(22090, 'Divorced', 'imp. & p. p.', 'of Divorce'),
(22091, 'Divorce', 'n.', 'To dissolve the marriage contract of, either wholly or\n   partially; to separate by divorce.'),
(22092, 'Divorce', 'n.', 'To separate or disunite; to sunder.'),
(22093, 'Divorce', 'n.', 'To make away; to put away.'),
(22094, 'Divorcee', 'n.', 'A person divorced.'),
(22095, 'Divorcer', 'n.', 'The person or cause that produces or effects a divorce.'),
(22096, 'Divot', 'n.', 'A thin, oblong turf used for covering cottages, and also for\n   fuel.'),
(22097, 'Divulged', 'imp. & p. p.', 'of Divulge'),
(22098, 'Divulge', 'v. t.', 'To make public; to several or communicate to the\n   public; to tell (a secret) so that it may become generally known; to\n   disclose; -- said of that which had been confided as a secret, or had\n   been before unknown; as, to divulge a secret.'),
(22099, 'Divulge', 'v. t.', 'To indicate publicly; to proclaim.'),
(22100, 'Divulge', 'v. t.', 'To impart; to communicate.'),
(22101, 'Divulge', 'v. i.', 'To become publicly known.'),
(22102, 'Dixie', 'n.', 'A colloquial name for the Southern portion of the United\n   States, esp. during the Civil War.'),
(22103, 'Dizened', 'imp. & p. p.', 'of Dizen'),
(22104, 'Dizening', 'p. pr. & vb. n.', 'of Dizen'),
(22105, 'Dizen', 'v. t.', 'To dress; to attire.'),
(22106, 'Dizen', 'v. t.', 'To dress gaudily; to overdress; to bedizen; to deck out.'),
(22107, 'Dizzard', 'n.', 'A blockhead. [Obs.] [Written also dizard, and disard.]'),
(22108, 'Dizzily', 'adv.', 'In a dizzy manner or state.'),
(22109, 'Dizzy', 'superl.', 'Having in the head a sensation of whirling, with a\n   tendency to fall; vertiginous; giddy; hence, confused; indistinct.'),
(22110, 'Dizzy', 'superl.', 'Causing, or tending to cause, giddiness or vertigo.'),
(22111, 'Dizzy', 'superl.', 'Without distinct thought; unreflecting; thoughtless;\n   heedless.'),
(22112, 'Dizzied', 'imp. & p. p.', 'of Dizzy'),
(22113, 'Dizzying', 'p. pr. & vb. n.', 'of Dizzy'),
(22114, 'Dizzy', 'v. t.', 'To make dizzy or giddy; to give the vertigo to; to\n   confuse.'),
(22115, 'Djereed', 'n.', 'Alt. of Djerrid'),
(22116, 'Djerrid', 'n.', 'A blunt javelin used in military games in Moslem\n   countries.'),
(22117, 'Djerrid', 'n.', 'A game played with it.'),
(22118, 'Jjinn', 'pl. ', 'of Djinnee'),
(22119, 'Djinns', 'pl. ', 'of Djinnee'),
(22120, 'Djinnee', 'n.', 'See Jinnee, Jinn.'),
(22121, 'Doing', 'p. pr. & vb. n.', 'of Do'),
(22122, 'Doable', 'a.', 'Capable of being done.'),
(22123, 'Do-all', 'n.', 'General manager; factotum.'),
(22124, 'Doand', 'p. pr.', 'Doing.'),
(22125, 'Dobber', 'n.', 'See Dabchick.'),
(22126, 'Dobber', 'n.', 'A float to a fishing line.'),
(22127, 'Dobbin', 'n.', 'An old jaded horse.'),
(22128, 'Dobbin', 'n.', 'Sea gravel mixed with sand.'),
(22129, 'Dobchick', 'n.', 'See Dabchick.'),
(22130, 'Dobson', 'n.', 'The aquatic larva of a large neuropterous insect (Corydalus\n   cornutus), used as bait in angling. See Hellgamite.'),
(22131, 'Dobule', 'n.', 'The European dace.'),
(22132, 'Docent', 'a.', 'Serving to instruct; teaching.'),
(22133, 'Docetae', 'n. pl.', 'Ancient heretics who held that Christ\'s body was\n   merely a phantom or appearance.'),
(22134, 'Docetic', 'a.', 'Pertaining to, held by, or like, the Docetae.'),
(22135, 'Docetism', 'n.', 'The doctrine of the Docetae.'),
(22136, 'Dochmiac', 'a.', 'Pertaining to, or containing, the dochmius.'),
(22137, 'Dochmius', 'n.', 'A foot of five syllables (usually / -- -/ -).'),
(22138, 'Docible', 'a.', 'Easily taught or managed; teachable.'),
(22139, 'Docile', 'a.', 'Teachable; easy to teach; docible.'),
(22140, 'Docile', 'a.', 'Disposed to be taught; tractable; easily managed; as, a\n   docile child.'),
(22141, 'Docility', 'n.', 'teachableness; aptness for being taught; docibleness.'),
(22142, 'Docility', 'n.', 'Willingness to be taught; tractableness.'),
(22143, 'Docimacy', 'n.', 'The art or practice of applying tests to ascertain the\n   nature, quality, etc., of objects, as of metals or ores, of medicines,\n   or of facts pertaining to physiology.'),
(22144, 'Docity', 'n.', 'Teachableness.'),
(22145, 'Docked', 'imp. & p. p.', 'of Dock'),
(22146, 'Docking', 'p. pr. & vb. n.', 'of Dock'),
(22147, 'Dockage', 'n.', 'A charge for the use of a dock.'),
(22148, 'Docket', 'n.', 'A small piece of paper or parchment, containing the heads\n   of a writing; a summary or digest.'),
(22149, 'Docket', 'n.', 'A bill tied to goods, containing some direction, as the\n   name of the owner, or the place to which they are to be sent; a label.'),
(22150, 'Docket', 'n.', 'An abridged entry of a judgment or proceeding in an action,\n   or register or such entries; a book of original, kept by clerks of\n   courts, containing a formal list of the names of parties, and minutes\n   of the proceedings, in each case in court.'),
(22151, 'Docket', 'n.', 'A list or calendar of causes ready for hearing or trial,\n   prepared for the use of courts by the clerks.'),
(22152, 'Docket', 'n.', 'A list or calendar of business matters to be acted on in\n   any assembly.'),
(22153, 'Docketed', 'imp. & p. p.', 'of Docket'),
(22154, 'Docket', 'v. t.', 'To make a brief abstract of (a writing) and indorse it\n   on the back of the paper, or to indorse the title or contents on the\n   back of; to summarize; as, to docket letters and papers.'),
(22155, 'Docket', 'v. t.', 'To make a brief abstract of and inscribe in a book; as,\n   judgments regularly docketed.'),
(22156, 'Docket', 'v. t.', 'To enter or inscribe in a docket, or list of causes for\n   trial.'),
(22157, 'Docket', 'v. t.', 'To mark with a ticket; as, to docket goods.'),
(22158, 'Dockyard', 'n.', 'A yard or storage place for all sorts of naval stores and\n   timber for shipbuilding.'),
(22159, 'Docquet', 'n. & v.', 'See Docket.'),
(22160, 'Doctor', 'n.', 'A teacher; one skilled in a profession, or branch of\n   knowledge learned man.'),
(22161, 'Doctor', 'n.', 'An academical title, originally meaning a men so well\n   versed in his department as to be qualified to teach it. Hence: One who\n   has taken the highest degree conferred by a university or college, or\n   has received a diploma of the highest degree; as, a doctor of divinity,\n   of law, of medicine, of music, or of philosophy. Such diplomas may\n   confer an honorary title only.'),
(22162, 'Doctor', 'n.', 'One duly licensed to practice medicine; a member of the\n   medical profession; a physician.'),
(22163, 'Doctor', 'n.', 'Any mechanical contrivance intended to remedy a difficulty\n   or serve some purpose in an exigency; as, the doctor of a\n   calico-printing machine, which is a knife to remove superfluous\n   coloring matter; the doctor, or auxiliary engine, called also donkey\n   engine.'),
(22164, 'Doctor', 'n.', 'The friar skate.'),
(22165, 'Doctored', 'imp. & p. p.', 'of Doctor'),
(22166, 'Doctor', 'v. t.', 'To treat as a physician does; to apply remedies to; to\n   repair; as, to doctor a sick man or a broken cart.'),
(22167, 'Doctor', 'v. t.', 'To confer a doctorate upon; to make a doctor.'),
(22168, 'Doctor', 'v. t.', 'To tamper with and arrange for one\'s own purposes; to\n   falsify; to adulterate; as, to doctor election returns; to doctor\n   whisky.'),
(22169, 'Doctor', 'v. i.', 'To practice physic.'),
(22170, 'Doctoral', 'a.', 'Of or relating to a doctor, or to the degree of doctor.'),
(22171, 'Doctorly', 'a.', 'Like a doctor or learned man.'),
(22172, 'Doctress', 'n.', 'A female doctor.'),
(22173, 'Doctrine', 'n.', 'Teaching; instruction.'),
(22174, 'Doctrine', 'n.', 'That which is taught; what is held, put forth as true,\n   and supported by a teacher, a school, or a sect; a principle or\n   position, or the body of principles, in any branch of knowledge; any\n   tenet or dogma; a principle of faith; as, the doctrine of atoms; the\n   doctrine of chances.'),
(22175, 'Document', 'n.', 'That which is taught or authoritatively set forth;\n   precept; instruction; dogma.'),
(22176, 'Document', 'n.', 'An example for instruction or warning.'),
(22177, 'Document', 'n.', 'An original or official paper relied upon as the basis,\n   proof, or support of anything else; -- in its most extended sense,\n   including any writing, book, or other instrument conveying information\n   in the case; any material substance on which the thoughts of men are\n   represented by any species of conventional mark or symbol.'),
(22178, 'Document', 'v. t.', 'To teach; to school.'),
(22179, 'Document', 'v. t.', 'To furnish with documents or papers necessary to\n   establish facts or give information; as, a a ship should be documented\n   according to the directions of law.'),
(22180, 'Doddart', 'n.', 'A game much like hockey, played in an open field; also,\n   the, bent stick for playing the game.'),
(22181, 'Dodded', 'a.', 'Without horns; as, dodded cattle; without beards; as,\n   dodded corn.'),
(22182, 'Dodder', 'n.', 'A plant of the genus Cuscuta. It is a leafless parasitical\n   vine with yellowish threadlike stems. It attaches itself to some other\n   plant, as to flax, goldenrod, etc., and decaying at the root, is\n   nourished by the plant that supports it.'),
(22183, 'Dodder', 'v. t. & i.', 'To shake, tremble, or totter.'),
(22184, 'Doddered', 'a.', 'Shattered; infirm.'),
(22185, 'Dodecane', 'n.', 'Any one of a group of thick oily hydrocarbons, C12H26, of\n   the paraffin series.'),
(22186, 'Dodged', 'imp. & p. p.', 'of Dodge'),
(22187, 'Dodging', 'p. pr. & vb. n.', 'of Dodge'),
(22188, 'Dodge', 'v. i.', 'To start suddenly aside, as to avoid a blow or a missile;\n   to shift place by a sudden start.'),
(22189, 'Dodge', 'v. i.', 'To evade a duty by low craft; to practice mean shifts; to\n   use tricky devices; to play fast and loose; to quibble.'),
(22190, 'Dodge', 'v. t.', 'To evade by a sudden shift of place; to escape by\n   starting aside; as, to dodge a blow aimed or a ball thrown.'),
(22191, 'Dodge', 'v. t.', 'Fig.: To evade by craft; as, to dodge a question; to\n   dodge responsibility.'),
(22192, 'Dodge', 'v. t.', 'To follow by dodging, or suddenly shifting from place to\n   place.'),
(22193, 'Dodge', 'n.', 'The act of evading by some skillful movement; a sudden\n   starting aside; hence, an artful device to evade, deceive, or cheat; a\n   cunning trick; an artifice.'),
(22194, 'Dodger', 'n.', 'One who dodges or evades; one who plays fast and loose, or\n   uses tricky devices.'),
(22195, 'Dodger', 'n.', 'A small handbill.'),
(22196, 'Dodger', 'n.', 'See Corndodger.'),
(22197, 'Dodgery', 'n.', 'trickery; artifice.'),
(22198, 'Dodipate', 'n.', 'Alt. of Dodipoll'),
(22199, 'Dodipoll', 'n.', 'A stupid person; a fool; a blockhead.'),
(22200, 'Dodkin', 'n.', 'A doit; a small coin.'),
(22201, 'Dodman', 'n.', 'A snail; also, a snail shell; a hodmandod.'),
(22202, 'Dodman', 'n.', 'Any shellfish which casts its shell, as a lobster.'),
(22203, 'Dodoes', 'pl. ', 'of Dodo'),
(22204, 'Doeglic', 'a.', 'Pertaining to, or obtained from, the doegling; as, doeglic\n   acid (Chem.), an oily substance resembling oleic acid.'),
(22205, 'Doegling', 'n.', 'The beaked whale (Balaenoptera rostrata), from which\n   doegling oil is obtained.'),
(22206, 'Doeskin', 'n.', 'The skin of the doe.'),
(22207, 'Doeskin', 'n.', 'A firm woolen cloth with a smooth, soft surface like a\n   doe\'s skin; -- made for men\'s wear.'),
(22208, 'Doffed', 'imp. & p. p.', 'of Doff'),
(22209, 'Doffing', 'p. pr. & vb. n.', 'of Doff'),
(22210, 'Doffer', 'n.', 'A revolving cylinder, or a vibrating bar with teeth, in a\n   carding machine, which doffs, or strips off, the cotton from the cards.'),
(22211, 'Dogged', 'imp. & p. p.', 'of Dog'),
(22212, 'Dogging', 'p. pr. & vb. n.', 'of Dog'),
(22213, 'Dogal', 'a.', 'Of or pertaining to a doge.'),
(22214, 'Dogate', 'n.', 'The office or dignity of a doge.'),
(22215, 'Dogbane', 'n.', 'A small genus of perennial herbaceous plants, with\n   poisonous milky juice, bearing slender pods pods in pairs.'),
(22216, 'Dog bee', '', 'A male or drone bee.'),
(22217, 'Dogberry', 'n.', 'The berry of the dogwood; -- called also dogcherry.'),
(22218, 'Dogbolt', 'n.', 'The bolt of the cap-square over the trunnion of a cannon.'),
(22219, 'Dogcart', 'n.', 'A light one-horse carriage, commonly two-wheeled,\n   patterned after a cart. The original dogcarts used in England by\n   sportsmen had a box at the back for carrying dogs.'),
(22220, 'Dog day', '', 'Alt. of Dogday'),
(22221, 'Dogday', '', 'One of the dog days.'),
(22222, 'Dog days', '', 'A period of from four to six weeks, in the summer,\n   variously placed by almanac makers between the early part of July and\n   the early part of September; canicular days; -- so called in reference\n   to the rising in ancient times of the Dog Star (Sirius) with the sun.\n   Popularly, the sultry, close part of the summer.'),
(22223, 'Dogdraw', 'n.', 'The act of drawing after, or pursuing, deer with a dog.'),
(22224, 'Dogeate', 'n.', 'Dogate.'),
(22225, 'Dogeless', 'a.', 'Without a doge.'),
(22226, 'Dogfish', 'n.', 'A small shark, of many species, of the genera Mustelus,\n   Scyllium, Spinax, etc.'),
(22227, 'Dogfish', 'n.', 'The bowfin (Amia calva). See Bowfin.'),
(22228, 'Dogfish', 'n.', 'The burbot of Lake Erie.'),
(22229, 'Dog-fox', 'n.', 'A male fox. See the Note under Dog, n., 6.'),
(22230, 'Dog-fox', 'n.', 'The Arctic or blue fox; -- a name also applied to species\n   of the genus Cynalopex.'),
(22231, 'Dogged', 'a.', 'Sullen; morose.'),
(22232, 'Dogged', 'a.', 'Sullenly obstinate; obstinately determined or persistent;\n   as, dogged resolution; dogged work.'),
(22233, 'Doggedly', 'adv.', 'In a dogged manner; sullenly; with obstinate\n   resolution.'),
(22234, 'Dogger', 'n.', 'A two-masted fishing vessel, used by the Dutch.'),
(22235, 'Dogger', 'n.', 'A sort of stone, found in the mines with the true alum\n   rock, chiefly of silica and iron.'),
(22236, 'Doggerel', 'a.', 'Low in style, and irregular in measure; as, doggerel\n   rhymes.'),
(22237, 'Doggerel', 'n.', 'A sort of loose or irregular verse; mean or undignified\n   poetry.'),
(22238, 'Dogget', 'n.', 'Docket. See Docket.'),
(22239, 'Doggish', 'a.', 'Like a dog; having the bad qualities of a dog; churlish;\n   growling; brutal.'),
(22240, 'Doggrel', 'a. & n.', 'Same as Doggerel.'),
(22241, 'Doghole', 'n.', 'A place fit only for dogs; a vile, mean habitation or\n   apartment.'),
(22242, 'Dogmas', 'pl. ', 'of Dogma'),
(22243, 'Dogmata', 'pl. ', 'of Dogma'),
(22244, 'Dogma', 'n.', 'That which is held as an opinion; a tenet; a doctrine.'),
(22245, 'Dogma', 'n.', 'A formally stated and authoritatively settled doctrine; a\n   definite, established, and authoritative tenet.'),
(22246, 'Dogma', 'n.', 'A doctrinal notion asserted without regard to evidence or\n   truth; an arbitrary dictum.'),
(22247, 'Dogmatic', 'n.', 'One of an ancient sect of physicians who went by general\n   principles; -- opposed to the Empiric.'),
(22248, 'Dogmatic', 'a.', 'Alt. of Dogmatical'),
(22249, 'Dog-rose', 'n.', 'A common European wild rose, with single pink or white\n   flowers.'),
(22250, 'Dogs-ear', 'n.', 'The corner of a leaf, in a book, turned down like the\n   ear of a dog.'),
(22251, 'Dogship', 'n.', 'The character, or individuality, of a dog.'),
(22252, 'Dogshore', 'n.', 'One of several shores used to hold a ship firmly and\n   prevent her moving while the blocks are knocked away before launching.'),
(22253, 'Dogsick', 'a.', 'Sick as a dog sometimes is very sick.'),
(22254, 'Dogskin', 'n.', 'The skin of a dog, or leather made of the skin. Also used\n   adjectively.'),
(22255, 'Dogsleep', 'n.', 'Pretended sleep.'),
(22256, 'Dogsleep', 'n.', 'The fitful naps taken when all hands are kept up by\n   stress.'),
(22257, 'Dog Star', '', 'Sirius, a star of the constellation Canis Major, or the\n   Greater Dog, and the brightest star in the heavens; -- called also\n   Canicula, and, in astronomical charts, / Canis Majoris. See Dog days.'),
(22258, 'Dogtie', 'n.', 'A cramp.'),
(22259, 'Dogteeth', 'pl. ', 'of Dogtooth'),
(22260, 'Dogtooth', 'n.', 'See Canine tooth, under Canine.'),
(22261, 'Dogtooth', 'n.', 'An ornament common in Gothic architecture, consisting of\n   pointed projections resembling teeth; -- also called tooth ornament.'),
(22262, 'Dogtrick', 'n.', 'A gentle trot, like that of a dog.'),
(22263, 'Dogvane', 'n.', 'A small vane of bunting, feathers, or any other light\n   material, carried at the masthead to indicate the direction of the\n   wind.'),
(22264, 'Dogwatch', 'n.', 'A half watch; a watch of two hours, of which there are\n   two, the first dogwatch from 4 to 6 o\'clock, p. m., and the second\n   dogwatch from 6 to 8 o\'clock, p. m.'),
(22265, 'Dogwood', 'n.', 'The Cornus, a genus of large shrubs or small trees, the\n   wood of which is exceedingly hard, and serviceable for many purposes.'),
(22266, 'Dohtren', 'n. pl.', 'Daughters.'),
(22267, 'Doily', 'n.', 'A kind of woolen stuff.'),
(22268, 'Doily', 'n.', 'A small napkin, used at table with the fruit, etc.; --\n   commonly colored and fringed.'),
(22269, 'Doings', 'pl. ', 'of Doing'),
(22270, 'Doing', 'n.', 'Anything done; a deed; an action good or bad; hence, in the\n   plural, conduct; behavior. See Do.'),
(22271, 'Doitkin', 'n.', 'A very small coin; a doit.'),
(22272, 'Dolabra', 'n.', 'A rude ancient ax or hatchet, seen in museums.'),
(22273, 'Dolce', 'adv.', 'Alt. of Dolcemente'),
(22274, 'Dolcino', 'n.', 'Alt. of Dulcino'),
(22275, 'Dulcino', 'n.', 'A small bassoon, formerly much used.'),
(22276, 'Doldrums', 'n. pl.', 'A part of the ocean near the equator, abounding in\n   calms, squalls, and light, baffling winds, which sometimes prevent all\n   progress for weeks; -- so called by sailors.'),
(22277, 'Doled', 'imp. & p. p.', 'of Dole'),
(22278, 'Doling', 'p. pr. & vb. n.', 'of Dole'),
(22279, 'Doleful', 'a.', 'Full of dole or grief; expressing or exciting sorrow;\n   sorrowful; sad; dismal.'),
(22280, 'Dolent', 'a.', 'Sorrowful.'),
(22281, 'Dolente', 'a. & adv.', 'Plaintively. See Doloroso.'),
(22282, 'Dolerite', 'n.', 'A dark-colored, basic, igneous rock, composed essentially\n   of pyroxene and a triclinic feldspar with magnetic iron. By many\n   authors it is considered equivalent to a coarse-grained basalt.'),
(22283, 'Dolesome', 'a.', 'Doleful; dismal; gloomy; sorrowful.'),
(22284, 'Doliolum', 'n.', 'A genus of freeswimming oceanic tunicates, allied to\n   Salpa, and having alternate generations.'),
(22285, 'Dolium', 'n.', 'A genus of large univalve mollusks, including the partridge\n   shell and tun shells.'),
(22286, 'Dollar', 'n.', 'A silver coin of the United States containing 371.25 grains\n   of silver and 41.25 grains of alloy, that is, having a total weight of\n   412.5 grains.'),
(22287, 'Dollar', 'n.', 'A gold coin of the United States containing 23.22 grains of\n   gold and 2.58 grains of alloy, that is, having a total weight of 25.8\n   grains, nine-tenths fine. It is no longer coined.'),
(22288, 'Dollar', 'n.', 'A coin of the same general weight and value, though\n   differing slightly in different countries, current in Mexico, Canada,\n   parts of South America, also in Spain, and several other European\n   countries.'),
(22289, 'Dollar', 'n.', 'The value of a dollar; the unit commonly employed in the\n   United States in reckoning money values.'),
(22290, 'Dollman', 'n.', 'See Dolman.'),
(22291, 'Dollies', 'pl. ', 'of Dolly'),
(22292, 'Dolly', 'n.', 'A contrivance, turning on a vertical axis by a handle or\n   winch, and giving a circular motion to the ore to be washed; a stirrer.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(22293, 'Dolly', 'n.', 'A tool with an indented head for shaping the head of a\n   rivet.'),
(22294, 'Dolly', 'n.', 'In pile driving, a block interposed between the head of the\n   pile and the ram of the driver.'),
(22295, 'Dolly', 'n.', 'A small truck with a single wide roller used for moving\n   heavy beams, columns, etc., in bridge building.'),
(22296, 'Dolly', 'n.', 'A compact, narrow-gauge locomotive used for moving\n   construction trains, switching, etc.'),
(22297, 'Dolly', 'n.', 'A child\'s mane for a doll.'),
(22298, 'Dolman', 'n.', 'A long robe or outer garment, with long sleeves, worn by\n   the Turks.'),
(22299, 'Dolman', 'n.', 'A cloak of a peculiar fashion worn by women.'),
(22300, 'Dolmen', 'n.', 'A cromlech. See Cromlech.'),
(22301, 'Dolomite', 'n.', 'A mineral consisting of the carbonate of lime and\n   magnesia in varying proportions. It occurs in distinct crystals, and in\n   extensive beds as a compact limestone, often crystalline granular,\n   either white or clouded. It includes much of the common white marble.\n   Also called bitter spar.'),
(22302, 'Dolomize', 'v. t.', 'To convert into dolomite.'),
(22303, 'Dolor', 'n.', 'Pain; grief; distress; anguish.'),
(22304, 'Doloroso', 'a. & adv.', 'Plaintive; pathetic; -- used adverbially as a\n   musical direction.'),
(22305, 'Dolorous', 'a.', 'Full of grief; sad; sorrowful; doleful; dismal; as, a\n   dolorous object; dolorous discourses.'),
(22306, 'Dolorous', 'a.', 'Occasioning pain or grief; painful.'),
(22307, 'Dolphin', 'n.', 'A cetacean of the genus Delphinus and allied genera (esp.\n   D. delphis); the true dolphin.'),
(22308, 'Dolphin', 'n.', 'The Coryphaena hippuris, a fish of about five feet in\n   length, celebrated for its surprising changes of color when dying. It\n   is the fish commonly known as the dolphin. See Coryphaenoid.'),
(22309, 'Dolphin', 'n.', 'A mass of iron or lead hung from the yardarm, in readiness\n   to be dropped on the deck of an enemy\'s vessel.'),
(22310, 'Dolphin', 'n.', 'A kind of wreath or strap of plaited cordage.'),
(22311, 'Dolphin', 'n.', 'A spar or buoy held by an anchor and furnished with a ring\n   to which ships may fasten their cables.'),
(22312, 'Dolphin', 'n.', 'A mooring post on a wharf or beach.'),
(22313, 'Dolphin', 'n.', 'A permanent fender around a heavy boat just below the\n   gunwale.'),
(22314, 'Dolphin', 'n.', 'In old ordnance, one of the handles above the trunnions by\n   which the gun was lifted.'),
(22315, 'Dolphin', 'n.', 'A small constellation between Aquila and Pegasus. See\n   Delphinus, n., 2.'),
(22316, 'Doltish', 'a.', 'Doltlike; dull in intellect; stupid; blockish; as, a\n   doltish clown.'),
(22317, 'Dolus', 'n.', 'Evil intent, embracing both malice and fraud. See Culpa.'),
(22318, 'Dolven', 'p. p.', 'of Delve.'),
(22319, 'Domable', 'a.', 'Capable of being tamed; tamable.'),
(22320, 'Domage', 'n.', 'Damage; hurt.'),
(22321, 'Domage', 'n.', 'Subjugation.'),
(22322, 'Domain', 'n.', 'Dominion; empire; authority.'),
(22323, 'Domain', 'n.', 'The territory over which dominion or authority is exerted;\n   the possessions of a sovereign or commonwealth, or the like. Also used\n   figuratively.'),
(22324, 'Domain', 'n.', 'Landed property; estate; especially, the land about the\n   mansion house of a lord, and in his immediate occupancy; demesne.'),
(22325, 'Domain', 'n.', 'Ownership of land; an estate or patrimony which one has in\n   his own right; absolute proprietorship; paramount or sovereign\n   ownership.'),
(22326, 'Domal', 'a.', 'Pertaining to a house.'),
(22327, 'Domanial', 'a.', 'Of or relating to a domain or to domains.'),
(22328, 'Domebook', 'n.', 'A book said to have been compiled under the direction of\n   King Alfred. It is supposed to have contained the principal maxims of\n   the common law, the penalties for misdemeanors, and the forms of\n   judicial proceedings. Domebook was probably a general name for book of\n   judgments.'),
(22329, 'Domed', 'a.', 'Furnished with a dome; shaped like a dome.'),
(22330, 'Domesday', 'n.', 'A day of judgment. See Doomsday.'),
(22331, 'Domesmen', 'pl. ', 'of Domesman'),
(22332, 'Domesman', 'n.', 'A judge; an umpire.'),
(22333, 'Domestic', 'a.', 'Of or pertaining to one\'s house or home, or one\'s\n   household or family; relating to home life; as, domestic concerns,\n   life, duties, cares, happiness, worship, servants.'),
(22334, 'Domestic', 'a.', 'Of or pertaining to a nation considered as a family or\n   home, or to one\'s own country; intestine; not foreign; as, foreign wars\n   and domestic dissensions.'),
(22335, 'Domestic', 'a.', 'Remaining much at home; devoted to home duties or\n   pleasures; as, a domestic man or woman.'),
(22336, 'Domestic', 'a.', 'Living in or near the habitations of man; domesticated;\n   tame as distinguished from wild; as, domestic animals.'),
(22337, 'Domestic', 'a.', 'Made in one\'s own house, nation, or country; as, domestic\n   manufactures, wines, etc.'),
(22338, 'Domestic', 'n.', 'One who lives in the family of an other, as hired\n   household assistant; a house servant.'),
(22339, 'Domestic', 'n.', 'Articles of home manufacture, especially cotton goods.'),
(22340, 'Domett', 'n.', 'A kind of baize of which the ward is cotton and the weft\n   woolen.'),
(22341, 'Domical', 'a.', 'Relating to, or shaped like, a dome.'),
(22342, 'Domicile', 'n.', 'An abode or mansion; a place of permanent residence,\n   either of an individual or a family.'),
(22343, 'Domicile', 'n.', 'A residence at a particular place accompanied with an\n   intention to remain there for an unlimited time; a residence accepted\n   as a final abode.'),
(22344, 'Domicile', 'v. t.', 'To establish in a fixed residence, or a residence that\n   constitutes habitancy; to domiciliate.'),
(22345, 'Domify', 'v. t.', 'To divide, as the heavens, into twelve houses. See\n   House, in astrological sense.'),
(22346, 'Domify', 'v. t.', 'To tame; to domesticate.'),
(22347, 'Domina', 'n.', 'Lady; a lady; -- a title formerly given to noble ladies who\n   held a barony in their own right.'),
(22348, 'Dominant', 'a.', 'Ruling; governing; prevailing; controlling; predominant;\n   as, the dominant party, church, spirit, power.'),
(22349, 'Dominant', 'n.', 'The fifth tone of the scale; thus G is the dominant of C,\n   A of D, and so on.'),
(22350, 'Dominate', 'v. t.', 'To predominate over; to rule; to govern.'),
(22351, 'Dominate', 'v. i.', 'To be dominant.'),
(22352, 'Domine', 'n.', 'A name given to a pastor of the Reformed Church. The word\n   is also applied locally in the United States, in colloquial speech, to\n   any clergyman.'),
(22353, 'Domine', 'n.', 'A West Indian fish (Epinula magistralis), of the family\n   Trichiuridae. It is a long-bodied, voracious fish.'),
(22354, 'Domineer', 'v. t.', 'To rule with insolence or arbitrary sway; to play the\n   master; to be overbearing; to tyrannize; to bluster; to swell with\n   conscious superiority or haughtiness; -- often with over; as, to\n   domineer over dependents.'),
(22355, 'Dominie', 'n.', 'A schoolmaster; a pedagogue.'),
(22356, 'Dominie', 'n.', 'A clergyman. See Domine, 1.'),
(22357, 'Dominion', 'n.', 'Sovereign or supreme authority; the power of governing\n   and controlling; independent right of possession, use, and control;\n   sovereignty; supremacy.'),
(22358, 'Dominion', 'n.', 'Superior prominence; predominance; ascendency.'),
(22359, 'Dominion', 'n.', 'That which is governed; territory over which authority is\n   exercised; the tract, district, or county, considered as subject; as,\n   the dominions of a king. Also used figuratively; as, the dominion of\n   the passions.'),
(22360, 'Dominion', 'n.', 'A supposed high order of angels; dominations. See\n   Domination, 3.'),
(22361, 'Dominos', 'pl. ', 'of Domino'),
(22362, 'Dominoes', 'pl. ', 'of Domino'),
(22363, 'Domino', 'n.', 'A kind of hood worn by the canons of a cathedral church; a\n   sort of amice.'),
(22364, 'Domino', 'n.', 'A mourning veil formerly worn by women.'),
(22365, 'Domino', 'n.', 'A kind of mask; particularly, a half mask worn at\n   masquerades, to conceal the upper part of the face. Dominos were\n   formerly worn by ladies in traveling.'),
(22366, 'Domino', 'n.', 'A costume worn as a disguise at masquerades, consisting of\n   a robe with a hood adjustable at pleasure.'),
(22367, 'Domino', 'n.', 'A person wearing a domino.'),
(22368, 'Domino', 'n.', 'A game played by two or more persons, with twenty-eight\n   pieces of wood, bone, or ivory, of a flat, oblong shape, plain at the\n   back, but on the face divided by a line in the middle, and either left\n   blank or variously dotted after the manner of dice. The game is played\n   by matching the spots or the blank of an unmatched half of a domino\n   already played'),
(22369, 'Domino', 'n.', 'One of the pieces with which the game of dominoes is\n   played.'),
(22370, 'Domini', 'pl. ', 'of Dominus'),
(22371, 'Dominus', 'n.', 'Master; sir; -- a title of respect formerly applied to a\n   knight or a clergyman, and sometimes to the lord of a manor.'),
(22372, 'Domite', 'n.', 'A grayish variety of trachyte; -- so called from the\n   Puy-de-Dome in Auvergne, France, where it is found.'),
(22373, 'Donned', 'imp. & p. p.', 'of Don'),
(22374, 'Donning', 'p. pr. & vb. n.', 'of Don'),
(22375, 'Donable', 'a.', 'Capable of being donated or given.'),
(22376, 'Donary', 'n.', 'A thing given to a sacred use.'),
(22377, 'Donat', 'n.', 'A grammar.'),
(22378, 'Donatary', 'n.', 'See Donatory.'),
(22379, 'Donated', 'imp. & p. p.', 'of Donate'),
(22380, 'Donating', 'p. pr. & vb. n.', 'of Donate'),
(22381, 'Donate', 'v. t.', 'To give; to bestow; to present; as, to donate fifty\n   thousand dollars to a college.'),
(22382, 'Donation', 'n.', 'The act of giving or bestowing; a grant.'),
(22383, 'Donation', 'n.', 'That which is given as a present; that which is\n   transferred to another gratuitously; a gift.'),
(22384, 'Donation', 'n.', 'The act or contract by which a person voluntarily\n   transfers the title to a thing of which be is the owner, from himself\n   to another, without any consideration, as a free gift.'),
(22385, 'Donatism', 'n.', 'The tenets of the Donatists.'),
(22386, 'Donatist', 'n.', 'A follower of Donatus, the leader of a body of North\n   African schismatics and purists, who greatly disturbed the church in\n   the 4th century. They claimed to be the true church.'),
(22387, 'Donative', 'n.', 'A gift; a largess; a gratuity; a present.'),
(22388, 'Donative', 'n.', 'A benefice conferred on a person by the founder or\n   patron, without either presentation or institution by the ordinary, or\n   induction by his orders. See the Note under Benefice, n., 3.'),
(22389, 'Donative', 'a.', 'Vested or vesting by donation; as, a donative advowson.'),
(22390, 'Donator', 'n.', 'One who makes a gift; a donor; a giver.'),
(22391, 'Donatory', 'n.', 'A donee of the crown; one the whom, upon certain\n   condition, escheated property is made over.'),
(22392, 'Donax', 'n.', 'A canelike grass of southern Europe (Arundo Donax), used for\n   fishing rods, etc.'),
(22393, 'Doncella', 'n.', 'A handsome fish of Florida and the West Indies\n   (Platyglossus radiatus). The name is applied also to the ladyfish\n   (Harpe rufa) of the same region.'),
(22394, 'Donee', 'n.', 'The person to whom a gift or donation is made.'),
(22395, 'Donee', 'n.', 'Anciently, one to whom lands were given; in later use, one\n   to whom lands and tenements are given in tail; in modern use, one on\n   whom a power is conferred for execution; -- sometimes called the\n   appointor.'),
(22396, 'Donet', 'n.', 'Same as Donat. Piers Plowman.'),
(22397, 'Donjon', 'n.', 'The chief tower, also called the keep; a massive tower in\n   ancient castles, forming the strongest part of the fortifications. See\n   Illust. of Castle.'),
(22398, 'Donkeys', 'pl. ', 'of Donkey'),
(22399, 'Donkey', 'n.', 'An ass; or (less frequently) a mule.'),
(22400, 'Donkey', 'n.', 'A stupid or obstinate fellow; an ass.'),
(22401, 'Donna', 'n.', 'A lady; madam; mistress; -- the title given a lady in Italy.'),
(22402, 'Donnat', 'n.', 'See Do-naught.'),
(22403, 'Donnism', 'n', 'Self-importance; loftiness of carriage.'),
(22404, 'Donor', 'n.', 'One who gives or bestows; one who confers anything\n   gratuitously; a benefactor.'),
(22405, 'Donor', 'n.', 'One who grants an estate; in later use, one who confers a\n   power; -- the opposite of donee.'),
(22406, 'Donship', 'n.', 'The quality or rank of a don, gentleman, or knight.'),
(22407, 'Donzel', 'n.', 'A young squire, or knight\'s attendant; a page.'),
(22408, 'Doodle', 'n.', 'A trifler; a simple fellow.'),
(22409, 'Doole', 'n.', 'Sorrow; dole.'),
(22410, 'Doolies', 'pl. ', 'of Dooly'),
(22411, 'Dooly', 'n.', 'A kind of litter suspended from men\'s shoulders, for\n   carrying persons or things; a palanquin.'),
(22412, 'Doomed', 'imp. & p. p.', 'of Doom'),
(22413, 'Dooming', 'p. pr. & vb. n.', 'of Doom'),
(22414, 'Doomage', 'n.', 'A penalty or fine for neglect.'),
(22415, 'Doomful', 'a.', 'Full of condemnation or destructive power.'),
(22416, 'Doomsday', 'n.', 'A day of sentence or condemnation; day of death.'),
(22417, 'Doomsday', 'n.', 'The day of the final judgment.'),
(22418, 'Doomsman', 'n.', 'A judge; an umpire.'),
(22419, 'Doomster', 'n.', 'Same as Dempster.'),
(22420, 'Doorcase', 'n.', 'The surrounding frame into which a door shuts.'),
(22421, 'Doorga', 'n.', 'A Hindoo divinity, the consort of Siva, represented with\n   ten arms.'),
(22422, 'Dooring', 'n.', 'The frame of a door.'),
(22423, 'Doorless', 'a.', 'Without a door.'),
(22424, 'Doornail', 'n.', 'The nail or knob on which in ancient doors the knocker\n   struck; -- hence the old saying, \"As dead as a doornail.\"'),
(22425, 'Doorpost', 'n.', 'The jamb or sidepiece of a doorway.'),
(22426, 'Doorsill', 'n.', 'The sill or threshold of a door.'),
(22427, 'Doorstep', 'n.', 'The stone or plank forming a step before an outer door.'),
(22428, 'Doorstop', 'n.', 'The block or strip of wood or similar material which\n   stops, at the right place, the shutting of a door.'),
(22429, 'Doorway', 'n.', 'The passage of a door; entrance way into a house or a\n   room.'),
(22430, 'Dooryard', 'n.', 'A yard in front of a house or around the door of a house.'),
(22431, 'Dopper', 'n.', 'An Anabaptist or Baptist.'),
(22432, 'Doquet', 'n.', 'A warrant. See Docket.'),
(22433, 'Dorado', 'n.', 'A southern constellation, within which is the south pole of\n   the ecliptic; -- called also sometimes Xiphias, or the Swordfish.'),
(22434, 'Dorado', 'n.', 'A large, oceanic fish of the genus Coryphaena.'),
(22435, 'Doree', 'n.', 'A European marine fish (Zeus faber), of a yellow color. See\n   Illust. of John Doree.'),
(22436, 'Doretree', 'n.', 'A doorpost.'),
(22437, 'Dorhawk', 'n.', 'The European goatsucker; -- so called because it eats the\n   dor beetle. See Goatsucker.'),
(22438, 'Dorian', 'a.', 'Of or pertaining to the ancient Greeks of Doris; Doric; as,\n   a Dorian fashion.'),
(22439, 'Dorian', 'a.', 'Same as Doric, 3.'),
(22440, 'Dorian', 'n.', 'A native or inhabitant of Doris in Greece.'),
(22441, 'Doric', 'a.', 'Pertaining to Doris, in ancient Greece, or to the Dorians;\n   as, the Doric dialect.'),
(22442, 'Doric', 'a.', 'Belonging to, or resembling, the oldest and simplest of the\n   three orders of architecture used by the Greeks, but ranked as second\n   of the five orders adopted by the Romans. See Abacus, Capital, Order.'),
(22443, 'Doric', 'a.', 'Of or relating to one of the ancient Greek musical modes or\n   keys. Its character was adapted both to religions occasions and to war.'),
(22444, 'Doric', 'n.', 'The Doric dialect.'),
(22445, 'Doricism', 'n.', 'A Doric phrase or idiom.'),
(22446, 'Doris', 'n.', 'A genus of nudibranchiate mollusks having a wreath of\n   branchiae on the back.'),
(22447, 'Dorism', 'n.', 'A Doric phrase or idiom.'),
(22448, 'Dormancy', 'n.', 'The state of being dormant; quiescence; abeyance.'),
(22449, 'Dormant', 'a.', 'Sleeping; as, a dormant animal; hence, not in action or\n   exercise; quiescent; at rest; in abeyance; not disclosed, asserted, or\n   insisted on; as, dormant passions; dormant claims or titles.'),
(22450, 'Dormant', 'a.', 'In a sleeping posture; as, a lion dormant; --\n   distinguished from couchant.'),
(22451, 'Dormant', 'a.', 'A large beam in the roof of a house upon which portions of\n   the other timbers rest or \" sleep.\"'),
(22452, 'Dormer', 'n.', 'Alt. of Dormer window'),
(22453, 'Dormice', 'pl. ', 'of Dormouse'),
(22454, 'Dormouse', 'n.', 'A small European rodent of the genus Myoxus, of several\n   species. They live in trees and feed on nuts, acorns, etc.; -- so\n   called because they are usually torpid in winter.'),
(22455, 'Dornick', 'n.', 'Alt. of Dornock'),
(22456, 'Dornock', 'n.', 'A coarse sort of damask, originally made at Tournay (in\n   Flemish, Doornick), Belgium, and used for hangings, carpets, etc. Also,\n   a stout figured linen manufactured in Scotland.'),
(22457, 'Dorrfly', 'n.', 'See 1st Dor.'),
(22458, 'Dorrhawk', 'n.', 'See Dorhawk.'),
(22459, 'Dorsad', 'adv.', 'Toward the dorsum or back; on the dorsal side; dorsally.'),
(22460, 'Dorsal', 'a.', 'Pertaining to, or situated near, the back, or dorsum, of an\n   animal or of one of its parts; notal; tergal; neural; as, the dorsal\n   fin of a fish; the dorsal artery of the tongue; -- opposed to ventral.'),
(22461, 'Dorsal', 'a.', 'Pertaining to the surface naturally inferior, as of a leaf.'),
(22462, 'Dorsal', 'a.', 'Pertaining to the surface naturally superior, as of a\n   creeping hepatic moss.'),
(22463, 'Dorsal', 'a.', 'A hanging, usually of rich stuff, at the back of a throne,\n   or of an altar, or in any similar position.'),
(22464, 'Dorsale', 'n.', 'Same as Dorsal, n.'),
(22465, 'Dorsally', 'adv.', 'On, or toward, the dorsum, or back; on the dorsal side\n   of; dorsad.'),
(22466, 'Dorse', 'n.', 'Same as dorsal, n.'),
(22467, 'Dorse', 'n.', 'The back of a book.'),
(22468, 'Dorse', 'n.', 'The Baltic or variable cod (Gadus callarias), by some\n   believed to be the young of the common codfish.'),
(22469, 'Dorsel', 'n.', 'A pannier.'),
(22470, 'Dorsel', 'n.', 'Same as Dorsal, n.'),
(22471, 'Dorser', 'n.', 'See Dosser.'),
(22472, 'Dorsum', 'n.', 'The ridge of a hill.'),
(22473, 'Dorsum', 'n.', 'The back or dorsal region of an animal; the upper side of\n   an appendage or part; as, the dorsum of the tongue.'),
(22474, 'Dortour', 'n.', 'Alt. of Dorture'),
(22475, 'Dorture', 'n.', 'A dormitory.'),
(22476, 'Dories', 'pl. ', 'of Dory'),
(22477, 'Dories', 'pl. ', 'of Dory'),
(22478, 'Dosed', 'imp. & p. p.', 'of Dose'),
(22479, 'dosing', 'p. pr. & vb. n.', 'of Dose'),
(22480, 'Dosel', 'n.', 'Same as Dorsal, n.'),
(22481, 'Dosology', 'n.', 'Posology.'),
(22482, 'Dossel', 'n.', 'Same as Dorsal, n.'),
(22483, 'Dosser', 'n.', 'A pannier, or basket.'),
(22484, 'Dosser', 'n.', 'A hanging tapestry; a dorsal.'),
(22485, 'Dossil', 'n.', 'A small ovoid or cylindrical roil or pledget of lint, for\n   keeping a sore, wound, etc., open; a tent.'),
(22486, 'Dossil', 'n.', 'A roll of cloth for wiping off the face of a copperplate,\n   leaving the ink in the engraved lines.'),
(22487, 'Dotted', 'imp. & p. p.', 'of Dot'),
(22488, 'Dotting', 'p. pr. & vb. n.', 'of Dot'),
(22489, 'Dotage', 'v. i.', 'Feebleness or imbecility of understanding or mind,\n   particularly in old age; the childishness of old age; senility; as, a\n   venerable man, now in his dotage.'),
(22490, 'Dotage', 'v. i.', 'Foolish utterance; drivel.'),
(22491, 'Dotage', 'v. i.', 'Excessive fondness; weak and foolish affection.'),
(22492, 'Dotal', 'a.', 'Pertaining to dower, or a woman\'s marriage portion;\n   constituting dower, or comprised in it.'),
(22493, 'Dotant', 'n.', 'A dotard.'),
(22494, 'Dotard', 'v. i.', 'One whose mind is impaired by age; one in second\n   childhood.'),
(22495, 'Dotardly', 'a.', 'Foolish; weak.'),
(22496, 'Dotary', 'n.', 'A dotard\'s weakness; dotage.'),
(22497, 'Dotation', 'n.', 'The act of endowing, or bestowing a marriage portion on a\n   woman.'),
(22498, 'Dotation', 'n.', 'Endowment; establishment of funds for support, as of a\n   hospital or eleemosynary corporation.'),
(22499, 'Doted', 'imp. & p. p.', 'of Dote'),
(22500, 'Doting', 'p. pr. & vb. n.', 'of Dote'),
(22501, 'Doted', 'a.', 'Stupid; foolish.'),
(22502, 'Doted', 'a.', 'Half-rotten; as, doted wood.'),
(22503, 'Dotehead', 'n.', 'A dotard.'),
(22504, 'Doter', 'n.', 'One who dotes; a man whose understanding is enfeebled by\n   age; a dotard.'),
(22505, 'Doter', 'n.', 'One excessively fond, or weak in love.'),
(22506, 'Dotery', 'n.', 'The acts or speech of a dotard; drivel.'),
(22507, 'Doting', 'a.', 'That dotes; silly; excessively fond.'),
(22508, 'Dotish', 'a.', 'Foolish; weak; imbecile.'),
(22509, 'Dottard', 'n.', 'An old, decayed tree.'),
(22510, 'Dotted', 'a.', 'Marked with, or made of, dots or small spots; diversified\n   with small, detached objects.'),
(22511, 'Dotterel', 'a.', 'Decayed.'),
(22512, 'Dotterel', 'v. i.', 'A European bird of the Plover family (Eudromias, /\n   Charadrius, morinellus). It is tame and easily taken, and is popularly\n   believed to imitate the movements of the fowler.'),
(22513, 'Dotterel', 'v. i.', 'A silly fellow; a dupe; a gull.'),
(22514, 'Dottrel', 'n.', 'See Dotterel.'),
(22515, 'Douane', 'n.', 'A customhouse.'),
(22516, 'Douanier', 'n.', 'An officer of the French customs.'),
(22517, 'Douar', 'n.', 'A village composed of Arab tents arranged in streets.'),
(22518, 'Double', 'a.', 'Twofold; multiplied by two; increased by its equivalent;\n   made twice as large or as much, etc.'),
(22519, 'Double', 'a.', 'Being in pairs; presenting two of a kind, or two in a set\n   together; coupled.'),
(22520, 'Double', 'a.', 'Divided into two; acting two parts, one openly and the\n   other secretly; equivocal; deceitful; insincere.'),
(22521, 'Double', 'a.', 'Having the petals in a flower considerably increased beyond\n   the natural number, usually as the result of cultivation and the\n   expense of the stamens, or stamens and pistils. The white water lily\n   and some other plants have their blossoms naturally double.'),
(22522, 'Double', 'adv.', 'Twice; doubly.'),
(22523, 'Doubled', 'imp. & p. p.', 'of Double'),
(22524, 'Doubling', 'p. pr. & vb. n.', 'of Double'),
(22525, 'Double', 'a.', 'To increase by adding an equal number, quantity, length,\n   value, or the like; multiply by two; to double a sum of money; to\n   double a number, or length.'),
(22526, 'Double', 'a.', 'To make of two thicknesses or folds by turning or bending\n   together in the middle; to fold one part upon another part of; as, to\n   double the leaf of a book, and the like; to clinch, as the fist; --\n   often followed by up; as, to double up a sheet of paper or cloth.'),
(22527, 'Double', 'a.', 'To be the double of; to exceed by twofold; to contain or be\n   worth twice as much as.'),
(22528, 'Double', 'a.', 'To pass around or by; to march or sail round, so as to\n   reverse the direction of motion.'),
(22529, 'Double', 'a.', 'To unite, as ranks or files, so as to form one from each\n   two.'),
(22530, 'Double', 'v. i.', 'To be increased to twice the sum, number, quantity,\n   length, or value; to increase or grow to twice as much.'),
(22531, 'Double', 'v. i.', 'To return upon one\'s track; to turn and go back over the\n   same ground, or in an opposite direction.'),
(22532, 'Double', 'v. i.', 'To play tricks; to use sleights; to play false.'),
(22533, 'Double', 'v. i.', 'To set up a word or words a second time by mistake; to\n   make a doublet.'),
(22534, 'Double', 'n.', 'Twice as much; twice the number, sum, quantity, length,\n   value, and the like.'),
(22535, 'Double', 'n.', 'Among compositors, a doublet (see Doublet, 2.); among\n   pressmen, a sheet that is twice pulled, and blurred.'),
(22536, 'Double', 'n.', 'That which is doubled over or together; a doubling; a\n   plait; a fold.'),
(22537, 'Double', 'n.', 'A turn or circuit in running to escape pursues; hence, a\n   trick; a shift; an artifice.'),
(22538, 'Double', 'n.', 'Something precisely equal or counterpart to another; a\n   counterpart. Hence, a wraith.'),
(22539, 'Double', 'n.', 'A player or singer who prepares to take the part of another\n   player in his absence; a substitute.'),
(22540, 'Double', 'n.', 'Double beer; strong beer.'),
(22541, 'Double', 'n.', 'A feast in which the antiphon is doubled, hat is, said\n   twice, before and after the Psalms, instead of only half being said, as\n   in simple feasts.'),
(22542, 'Double', 'n.', 'A game between two pairs of players; as, a first prize for\n   doubles.'),
(22543, 'Double', 'n.', 'An old term for a variation, as in Bach\'s Suites.'),
(22544, 'Doubler', 'n.', 'One who, or that which, doubles.'),
(22545, 'Doubler', 'n.', 'An instrument for augmenting a very small quantity of\n   electricity, so as to render it manifest by sparks or the electroscope.'),
(22546, 'Doublet', 'a.', 'Two of the same kind; a pair; a couple.'),
(22547, 'Doublet', 'a.', 'A word or words unintentionally doubled or set up a second\n   time.'),
(22548, 'Doublet', 'a.', 'A close-fitting garment for men, covering the body from\n   the neck to the waist or a little below. It was worn in Western Europe\n   from the 15th to the 17th century.'),
(22549, 'Doublet', 'a.', 'A counterfeit gem, composed of two pieces of crystal, with\n   a color them, and thus giving the appearance of a naturally colored\n   gem. Also, a piece of paste or glass covered by a veneer of real stone.'),
(22550, 'Doublet', 'a.', 'An arrangement of two lenses for a microscope, designed to\n   correct spherical aberration and chromatic dispersion, thus rendering\n   the image of an object more clear and distinct.'),
(22551, 'Doublet', 'a.', 'Two dice, each of which, when thrown, has the same number\n   of spots on the face lying uppermost; as, to throw doublets.'),
(22552, 'Doublet', 'a.', 'A game somewhat like backgammon.'),
(22553, 'Doublet', 'a.', 'One of two or more words in the same language derived by\n   different courses from the same original from; as, crypt and grot are\n   doublets; also, guard and ward; yard and garden; abridge and\n   abbreviate, etc.'),
(22554, 'Doublets', 'n. pl.', 'See Doublet, 6 and 7.'),
(22555, 'Doubling', 'n.', 'The act of one that doubles; a making double;\n   reduplication; also, that which is doubled.'),
(22556, 'Doubling', 'n.', 'A turning and winding; as, the doubling of a hunted hare;\n   shift; trick; artifice.'),
