(22795, 'Dramatic', 'a.', 'Alt. of Dramatical'),
(22796, 'Dramming', 'n.', 'The practice of drinking drams.'),
(22797, 'Dramshop', 'n.', 'A shop or barroom where spirits are sold by the dram.'),
(22798, 'Drank', 'imp.', 'of Drink.'),
(22799, 'Drank', 'n.', 'Wild oats, or darnel grass. See Drake a plant.'),
(22800, 'Draped', 'imp. & p. p.', 'of Drape'),
(22801, 'Draping', 'p. pr. & vb. n.', 'of Drape'),
(22802, 'Drape', 'v. t.', 'To cover or adorn with drapery or folds of cloth, or as\n   with drapery; as, to drape a bust, a building, etc.'),
(22803, 'Drape', 'v. t.', 'To rail at; to banter.'),
(22804, 'Drape', 'v. i.', 'To make cloth.'),
(22805, 'Drape', 'v. i.', 'To design drapery, arrange its folds, etc., as for\n   hangings, costumes, statues, etc.'),
(22806, 'Draper', 'n.', 'One who sells cloths; a dealer in cloths; as, a draper and\n   tailor.'),
(22807, 'Drapery', 'n.', 'The occupation of a draper; cloth-making, or dealing in\n   cloth.'),
(22808, 'Drapery', 'n.', 'Cloth, or woolen stuffs in general.'),
(22809, 'Drapery', 'n.', 'A textile fabric used for decorative purposes, especially\n   when hung loosely and in folds carefully disturbed; as: (a) Garments or\n   vestments of this character worn upon the body, or shown in the\n   representations of the human figure in art. (b) Hangings of a room or\n   hall, or about a bed.'),
(22810, 'Drapet', 'n.', 'Cloth.'),
(22811, 'Drastic', 'a.', 'Acting rapidly and violently; efficacious; powerful; --\n   opposed to bland; as, drastic purgatives.'),
(22812, 'Drastic', 'n.', 'A violent purgative. See Cathartic.'),
(22813, 'Drasty', 'a.', 'Filthy; worthless.'),
(22814, 'Draugh', 'n.', 'See Draft.'),
(22815, 'Draught', 'n.', 'The act of drawing or pulling'),
(22816, 'Draught', 'n.', 'The act of moving loads by drawing, as by beasts of\n   burden, and the like.'),
(22817, 'Draught', 'n.', 'The drawing of a bowstring.'),
(22818, 'Draught', 'n.', 'Act of drawing a net; a sweeping the water for fish.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(22819, 'Draught', 'n.', 'The act of drawing liquor into the mouth and throat; the\n   act of drinking.'),
(22820, 'Draught', 'n.', 'A sudden attack or drawing upon an enemy.'),
(22821, 'Draught', 'n.', 'The act of selecting or detaching soldiers; a draft (see\n   Draft, n., 2)'),
(22822, 'Draught', 'n.', 'The act of drawing up, marking out, or delineating;\n   representation.'),
(22823, 'Draught', 'n.', 'That which is drawn'),
(22824, 'Draught', 'n.', 'That which is taken by sweeping with a net.'),
(22825, 'Draught', 'n.', 'The force drawn; a detachment; -- in this sense usually\n   written draft.'),
(22826, 'Draught', 'n.', 'The quantity drawn in at once in drinking; a potion or\n   potation.'),
(22827, 'Draught', 'n.', 'A sketch, outline, or representation, whether written,\n   designed, or drawn; a delineation.'),
(22828, 'Draught', 'n.', 'An order for the payment of money; -- in this sense almost\n   always written draft.'),
(22829, 'Draught', 'n.', 'A current of air moving through an inclosed place, as\n   through a room or up a chimney.'),
(22830, 'Draught', 'n.', 'That which draws'),
(22831, 'Draught', 'n.', 'A team of oxen or horses.'),
(22832, 'Draught', 'n.', 'A sink or drain; a privy.'),
(22833, 'Draught', 'n.', 'A mild vesicatory; a sinapism; as, to apply draughts to\n   the feet.'),
(22834, 'Draught', 'n.', 'Capacity of being drawn; force necessary to draw;\n   traction.'),
(22835, 'Draught', 'n.', 'The depth of water necessary to float a ship, or the depth\n   a ship sinks in water, especially when laden; as, a ship of twelve feet\n   draught.'),
(22836, 'Draught', 'n.', 'An allowance on weighable goods. [Eng.] See Draft, 4.'),
(22837, 'Draught', 'n.', 'A move, as at chess or checkers.'),
(22838, 'Draught', 'n.', 'The bevel given to the pattern for a casting, in order\n   that it may be drawn from the sand without injury to the mold.'),
(22839, 'Draught', 'n.', 'See Draft, n., 7.'),
(22840, 'Draught', 'a.', 'Used for drawing vehicles, loads, etc.; as, a draught\n   beast; draught hooks.'),
(22841, 'Draught', 'a.', 'Relating to, or characterized by, a draft, or current of\n   air.'),
(22842, 'Draught', 'a.', 'Used in making drawings; as, draught compasses.'),
(22843, 'Draught', 'a.', 'Drawn directly from the barrel, or other receptacle, in\n   distinction from bottled; on draught; -- said of ale, cider, and the\n   like.'),
(22844, 'Draught', 'v. t.', 'To draw out; to call forth. See Draft.'),
(22845, 'Draught', 'v. t.', 'To diminish or exhaust by drawing.'),
(22846, 'Draught', 'v. t.', 'To draw in outline; to make a draught, sketch, or plan\n   of, as in architectural and mechanical drawing.'),
(22847, 'Draughts', 'n. pl.', 'A mild vesicatory. See Draught, n., 3 (c).'),
(22848, 'Draughts', 'n. pl.', 'A game, now more commonly called checkers. See\n   Checkers.'),
(22849, 'Draughty', 'a.', 'Pertaining to a draught, or current of air; as, a\n   draughtly, comfortless room.'),
(22850, 'Drave', '', 'old imp. of Drive.'),
(22851, 'Dravida', 'n. pl.', 'A race of Hindostan, believed to be the original\n   people who occupied the land before the Hindoo or Aryan invasion.'),
(22852, 'Drawn', 'p. p.', 'of Draw'),
(22853, 'Drawing', 'p. pr. & vb. n.', 'of Draw'),
(22854, 'Drawable', 'a.', 'Capable of being drawn.'),
(22855, 'Drawback', 'n.', 'A loss of advantage, or deduction from profit, value,\n   success, etc.; a discouragement or hindrance; objectionable feature.'),
(22856, 'Drawback', 'n.', 'Money paid back or remitted; especially, a certain amount\n   of duties or customs, sometimes the whole, and sometimes only a part,\n   remitted or paid back by the government, on the exportation of the\n   commodities on which they were levied.'),
(22857, 'Drawbar', 'n.', 'An openmouthed bar at the end of a car, which receives a\n   coupling link and pin by which the car is drawn. It is usually provided\n   with a spring to give elasticity to the connection between the cars of\n   a train.'),
(22858, 'Drawbar', 'n.', 'A bar of iron with an eye at each end, or a heavy link,\n   for coupling a locomotive to a tender or car.'),
(22859, 'Drawbolt', 'n.', 'A coupling pin. See under Coupling.'),
(22860, 'Drawbore', 'n.', 'A hole bored through a tenon nearer to the shoulder than\n   the holes through the cheeks are to the edge or abutment against which\n   the shoulder is to rest, so that a pin or bolt, when driven into it,\n   will draw these parts together.'),
(22861, 'Drawbore', 'v. t.', 'To make a drawbore in; as, to drawbore a tenon.'),
(22862, 'Drawbore', 'v. t.', 'To enlarge the bore of a gun barrel by drawing,\n   instead of thrusting, a revolving tool through it.'),
(22863, 'Drawboy', 'n.', 'A boy who operates the harness cords of a hand loom; also,\n   a part of power loom that performs the same office.'),
(22864, 'Draw-cut', 'n.', 'A single cut with a knife.'),
(22865, 'Drawee', 'n.', 'The person on whom an order or bill of exchange is drawn;\n   -- the correlative of drawer.'),
(22866, 'Drawer', 'n.', 'One who, or that which, draws'),
(22867, 'Drawer', 'n.', 'One who draws liquor for guests; a waiter in a taproom.'),
(22868, 'Drawer', 'n.', 'One who delineates or depicts; a draughtsman; as, a good\n   drawer.'),
(22869, 'Drawer', 'n.', 'One who draws a bill of exchange or order for payment; --\n   the correlative of drawee.'),
(22870, 'Drawer', 'n.', 'That which is drawn'),
(22871, 'Drawer', 'n.', 'A sliding box or receptacle in a case, which is opened by\n   pulling or drawing out, and closed by pushing in.'),
(22872, 'Drawer', 'n.', 'An under-garment worn on the lower limbs.'),
(22873, 'Drawgear', 'n.', 'A harness for draught horses.'),
(22874, 'Drawgear', 'n.', 'The means or parts by which cars are connected to be\n   drawn.'),
(22875, 'Drawhead', 'n.', 'The flanged outer end of a drawbar; also, a name applied\n   to the drawgear.'),
(22876, 'Drawing', 'n.', 'The act of pulling, or attracting.'),
(22877, 'Drawing', 'n.', 'The act or the art of representing any object by means of\n   lines and shades; especially, such a representation when in one color,\n   or in tints used not to represent the colors of natural objects, but\n   for effect only, and produced with hard material such as pencil, chalk,\n   etc.; delineation; also, the figure or representation drawn.'),
(22878, 'Drawing', 'n.', 'The process of stretching or spreading metals as by\n   hammering, or, as in forming wire from rods or tubes and cups from\n   sheet metal, by pulling them through dies.'),
(22879, 'Drawing', 'n.', 'The process of pulling out and elongating the sliver from\n   the carding machine, by revolving rollers, to prepare it for spinning.'),
(22880, 'Drawing', 'n.', 'The distribution of prizes and blanks in a lottery.'),
(22881, 'Drawled', 'imp. & p. p.', 'of Drawl'),
(22882, 'Drawling', 'p. pr. & vb. n.', 'of Drawl'),
(22883, 'Drawl', 'v. t.', 'To utter in a slow, lengthened tone.'),
(22884, 'Drawl', 'v. i.', 'To speak with slow and lingering utterance, from\n   laziness, lack of spirit, affectation, etc.'),
(22885, 'Drawl', 'n.', 'A lengthened, slow monotonous utterance.'),
(22886, 'Drawling', 'n.', 'The act of speaking with a drawl; a drawl.'),
(22887, 'Drawlink', 'n.', 'Same as Drawbar (b).'),
(22888, 'Drawloom', 'n.', 'A kind of loom used in weaving figured patterns; --\n   called also drawboy.'),
(22889, 'Drawloom', 'n.', 'A species of damask made on the drawloom.'),
(22890, 'Drawn', 'p. p. & a.', 'See Draw, v. t. & i.'),
(22891, 'Drawnet', 'n.', 'A net for catching the larger sorts of birds; also, a\n   dragnet.'),
(22892, 'Drawrod', 'n.', 'A rod which unites the drawgear at opposite ends of the\n   car, and bears the pull required to draw the train.'),
(22893, 'Drayage', 'n.', 'Use of a dray.'),
(22894, 'Drayage', 'n.', 'The charge, or sum paid, for the use of a dray.'),
(22895, 'Draymen', 'pl. ', 'of Drayman'),
(22896, 'Drayman', 'n.', 'A man who attends a dray.'),
(22897, 'Drazel', 'n.', 'A slut; a vagabond wench. Same as Drossel.'),
(22898, 'Dreaded', 'imp. & p. p.', 'of Dread'),
(22899, 'Dreading', 'p. pr. & vb. n.', 'of Dread'),
(22900, 'Dread', 'v. t.', 'To fear in a great degree; to regard, or look forward to,\n   with terrific apprehension.'),
(22901, 'Dread', 'v. i.', 'To be in dread, or great fear.'),
(22902, 'Dread', 'n.', 'Great fear in view of impending evil; fearful apprehension\n   of danger; anticipatory terror.'),
(22903, 'Dread', 'n.', 'Reverential or respectful fear; awe.'),
(22904, 'Dread', 'n.', 'An object of terrified apprehension.'),
(22905, 'Dread', 'n.', 'A person highly revered.'),
(22906, 'Dread', 'n.', 'Fury; dreadfulness.'),
(22907, 'Dread', 'n.', 'Doubt; as, out of dread.'),
(22908, 'Dread', 'a.', 'Exciting great fear or apprehension; causing terror;\n   frightful; dreadful.'),
(22909, 'Dread', 'a.', 'Inspiring with reverential fear; awful\' venerable; as, dread\n   sovereign; dread majesty; dread tribunal.'),
(22910, 'Dreader', 'n.', 'One who fears, or lives in fear.'),
(22911, 'Dreadful', 'a.', 'Full of dread or terror; fearful.'),
(22912, 'Dreadful', 'a.', 'Inspiring dread; impressing great fear; fearful;\n   terrible; as, a dreadful storm.'),
(22913, 'Dreadful', 'a.', 'Inspiring awe or reverence; awful.'),
(22914, 'Dreadly', 'a.', 'Dreadful.'),
(22915, 'Dreadly', 'adv.', 'With dread.'),
(22916, 'Dream', 'n.', 'The thoughts, or series of thoughts, or imaginary\n   transactions, which occupy the mind during sleep; a sleeping vision.'),
(22917, 'Dream', 'n.', 'A visionary scheme; a wild conceit; an idle fancy; a vagary;\n   a revery; -- in this sense, applied to an imaginary or anticipated\n   state of happiness; as, a dream of bliss; the dream of his youth.'),
(22918, 'Dreamed', 'imp. & p. p.', 'of Dream'),
(22919, 'Dreamt', '', 'of Dream'),
(22920, 'Dreaming', 'p. pr. & vb. n.', 'of Dream'),
(22921, 'Dream', 'n.', 'To have ideas or images in the mind while in the state of\n   sleep; to experience sleeping visions; -- often with of; as, to dream\n   of a battle, or of an absent friend.'),
(22922, 'Dream', 'n.', 'To let the mind run on in idle revery or vagary; to\n   anticipate vaguely as a coming and happy reality; to have a visionary\n   notion or idea; to imagine.'),
(22923, 'Dream', 'v. t.', 'To have a dream of; to see, or have a vision of, in\n   sleep, or in idle fancy; -- often followed by an objective clause.'),
(22924, 'Dreamer', 'n.', 'One who dreams.'),
(22925, 'Dreamer', 'n.', 'A visionary; one lost in wild imaginations or vain schemes\n   of some anticipated good; as, a political dreamer.'),
(22926, 'Dreamful', 'a.', 'Full of dreams.'),
(22927, 'Dreamily', 'adv.', 'As if in a dream; softly; slowly; languidly.'),
(22928, 'Dreamy', 'superl.', 'Abounding in dreams or given to dreaming; appropriate\n   to, or like, dreams; visionary.'),
(22929, 'Drear', 'a.', 'Dismal; gloomy with solitude.'),
(22930, 'Drear', 'n.', 'Sadness; dismalness.'),
(22931, 'Drearily', 'adv.', 'Gloomily; dismally.'),
(22932, 'Drearing', 'n.', 'Sorrow.'),
(22933, 'Dreary', 'superl.', 'Sorrowful; distressful.'),
(22934, 'Dreary', 'superl.', 'Exciting cheerless sensations, feelings, or\n   associations; comfortless; dismal; gloomy.'),
(22935, 'Drecche', 'v. t.', 'To vex; to torment; to trouble.'),
(22936, 'Drecche', 'v. i.', 'To delay.'),
(22937, 'Dredge', 'n.', 'Any instrument used to gather or take by dragging; as: (a)\n   A dragnet for taking up oysters, etc., from their beds. (b) A dredging\n   machine. (c) An iron frame, with a fine net attached, used in\n   collecting animals living at the bottom of the sea.'),
(22938, 'Dredge', 'n.', 'Very fine mineral matter held in suspension in water.'),
(22939, 'Dredged', 'imp. & p. p.', 'of Dredge'),
(22940, 'Dredging', 'p. pr. & vb. n.', 'of Dredge'),
(22941, 'Dredge', 'v. t.', 'To catch or gather with a dredge; to deepen with a\n   dredging machine.'),
(22942, 'Dredge', 'n.', 'A mixture of oats and barley.'),
(22943, 'Dredge', 'v. t.', 'To sift or sprinkle flour, etc., on, as on roasting\n   meat.'),
(22944, 'Dredger', 'n.', 'One who fishes with a dredge.'),
(22945, 'Dredger', 'n.', 'A dredging machine.'),
(22946, 'Dredger', 'n.', 'A box with holes in its lid; -- used for sprinkling flour,\n   as on meat or a breadboard; -- called also dredging box, drudger, and\n   drudging box.'),
(22947, 'Dreggish', 'a.', 'Foul with lees; feculent.'),
(22948, 'Dreggy', 'a.', 'Containing dregs or lees; muddy; foul; feculent.'),
(22949, 'Drein', 'v. i.', 'To drain.'),
(22950, 'Dreint', '', 'p. p. of Drench to drown.'),
(22951, 'Drenched', 'imp. & p. p.', 'of Drench'),
(22952, 'Drench', 'v. t.', 'To cause to drink; especially, to dose by force; to put\n   a potion down the throat of, as of a horse; hence. to purge violently\n   by physic.'),
(22953, 'Drench', 'v. t.', 'To steep in moisture; to wet thoroughly; to soak; to\n   saturate with water or other liquid; to immerse.'),
(22954, 'Drench', 'v. t.', 'A drink; a draught; specifically, a potion of medicine\n   poured or forced down the throat; also, a potion that causes purging.'),
(22955, 'Drench', 'n.', 'A military vassal mentioned in Domesday Book.'),
(22956, 'Drenche', 'v. t. & i.', 'To drown.'),
(22957, 'Drencher', 'n.', 'One who, or that which, west or steeps.'),
(22958, 'Drencher', 'n.', 'One who administers a drench.'),
(22959, 'Drengage', 'n.', 'The tenure by which a drench held land.'),
(22960, 'Drent', 'p. p.', 'Drenched; drowned.'),
(22961, 'Dressed', 'imp. & p. p.', 'of Dress'),
(22962, 'Drest', '', 'of Dress'),
(22963, 'Dressing', 'p. pr. & vb. n.', 'of Dress'),
(22964, 'Dress', 'v. t.', 'To direct; to put right or straight; to regulate; to\n   order.'),
(22965, 'Dress', 'v. t.', 'To arrange in exact continuity of line, as soldiers;\n   commonly to adjust to a straight line and at proper distance; to align;\n   as, to dress the ranks.'),
(22966, 'Dress', 'v. t.', 'To treat methodically with remedies, bandages, or\n   curative appliances, as a sore, an ulcer, a wound, or a wounded or\n   diseased part.'),
(22967, 'Dress', 'v. t.', 'To adjust; to put in good order; to arrange;\n   specifically: (a) To prepare for use; to fit for any use; to render\n   suitable for an intended purpose; to get ready; as, to dress a slain\n   animal; to dress meat; to dress leather or cloth; to dress or trim a\n   lamp; to dress a garden; to dress a horse, by currying and rubbing; to\n   dress grain, by cleansing it; in mining and metallurgy, to dress ores,\n   by sorting and separating them.'),
(22968, 'Dress', 'v. t.', 'To cut to proper dimensions, or give proper shape to, as\n   to a tool by hammering; also, to smooth or finish.'),
(22969, 'Dress', 'v. t.', 'To put in proper condition by appareling, as the body; to\n   put clothes upon; to apparel; to invest with garments or rich\n   decorations; to clothe; to deck.'),
(22970, 'Dress', 'v. t.', 'To break and train for use, as a horse or other animal.'),
(22971, 'Dress', 'v. i.', 'To arrange one\'s self in due position in a line of\n   soldiers; -- the word of command to form alignment in ranks; as, Right,\n   dress!'),
(22972, 'Dress', 'v. i.', 'To clothe or apparel one\'s self; to put on one\'s\n   garments; to pay particular regard to dress; as, to dress quickly.'),
(22973, 'Dress', 'n.', 'That which is used as the covering or ornament of the body;\n   clothes; garments; habit; apparel.'),
(22974, 'Dress', 'n.', 'A lady\'s gown; as, silk or a velvet dress.'),
(22975, 'Dress', 'n.', 'Attention to apparel, or skill in adjusting it.'),
(22976, 'Dress', 'n.', 'The system of furrows on the face of a millstone.'),
(22977, 'Dresser', 'n.', 'One who dresses; one who put in order or makes ready for\n   use; one who on clothes or ornaments.'),
(22978, 'Dresser', 'n.', 'A kind of pick for shaping large coal.'),
(22979, 'Dresser', 'n.', 'An assistant in a hospital, whose office it is to dress\n   wounds, sores, etc.'),
(22980, 'Dresser', 'v. t.', 'A table or bench on which meat and other things are\n   dressed, or prepared for use.'),
(22981, 'Dresser', 'v. t.', 'A cupboard or set of shelves to receive dishes and\n   cooking utensils.'),
(22982, 'Dressing', 'n.', 'Dress; raiment; especially, ornamental habiliment or\n   attire.'),
(22983, 'Dressing', 'n.', 'An application (a remedy, bandage, etc.) to a sore or\n   wound.'),
(22984, 'Dressing', 'n.', 'Manure or compost over land. When it remains on the\n   surface, it is called a top-dressing.'),
(22985, 'Dressing', 'n.', 'A preparation to fit food for use; a condiment; as, a\n   dressing for salad.'),
(22986, 'Dressing', 'n.', 'The stuffing of fowls, pigs, etc.; forcemeat.'),
(22987, 'Dressing', 'n.', 'Gum, starch, and the like, used in stiffening or\n   finishing silk, linen, and other fabrics.'),
(22988, 'Dressing', 'n.', 'An ornamental finish, as a molding around doors, windows,\n   or on a ceiling, etc.'),
(22989, 'Dressing', 'n.', 'Castigation; scolding; -- often with down.'),
(22990, 'Dressy', 'a.', 'Showy in dress; attentive to dress.'),
(22991, 'Drest', 'p. p.', 'of Dress.'),
(22992, 'Dretch', 'v. t. & i.', 'See Drecche.'),
(22993, 'Dreul', 'v. i.', 'To drool.'),
(22994, 'Drevil', 'n.', 'A fool; a drudge. See Drivel.'),
(22995, 'Dreye', 'a.', 'Dry.'),
(22996, 'Dreynt', '', 'p. p., of Drench to drown.'),
(22997, 'Dribbed', 'imp. & p. p.', 'of Drib'),
(22998, 'Dribbing', 'p. pr. & vb. n.', 'of Drib'),
(22999, 'Dribber', 'n.', 'One who dribs; one who shoots weakly or badly.'),
(23000, 'Dribbled', 'imp. & p. p.', 'of Dribble'),
(23001, 'Dribbing', 'p. pr. & vb. n.', 'of Dribble'),
(23002, 'Dribble', 'v. i.', 'To fall in drops or small drops, or in a quick\n   succession of drops; as, water dribbles from the eaves.'),
(23003, 'Dribble', 'v. i.', 'To slaver, as a child or an idiot; to drivel.'),
(23004, 'Dribble', 'v. i.', 'To fall weakly and slowly.'),
(23005, 'Dribble', 'v. t.', 'To let fall in drops.'),
(23006, 'Dribble', 'n.', 'A drizzling shower; a falling or leaking in drops.'),
(23007, 'Dribbler', 'n.', 'One who dribbles.'),
(23008, 'Dribblet', 'n.', 'Alt. of Driblet'),
(23009, 'Driblet', 'n.', 'A small piece or part; a small sum; a small quantity of\n   money in making up a sum; as, the money was paid in dribblets.'),
(23010, 'Dried', 'imp. & p. p.', 'of Day. Also adj.; as, dried apples.'),
(23011, 'Drier', 'n.', 'One who, or that which, dries; that which may expel or\n   absorb moisture; a desiccative; as, the sun and a northwesterly wind\n   are great driers of the earth.'),
(23012, 'Drier', 'n.', 'Drying oil; a substance mingled with the oil used in oil\n   painting to make it dry quickly.'),
(23013, 'Drier', 'superl.', 'Alt. of Driest'),
(23014, 'Driest', 'superl.', 'of Dry, a.'),
(23015, 'Drift', 'n.', 'A driving; a violent movement.'),
(23016, 'Drift', 'n.', 'The act or motion of drifting; the force which impels or\n   drives; an overpowering influence or impulse.'),
(23017, 'Drift', 'n.', 'Course or direction along which anything is driven; setting.'),
(23018, 'Drift', 'n.', 'The tendency of an act, argument, course of conduct, or the\n   like; object aimed at or intended; intention; hence, also, import or\n   meaning of a sentence or discourse; aim.'),
(23019, 'Drift', 'n.', 'That which is driven, forced, or urged along'),
(23020, 'Drift', 'n.', 'Anything driven at random.'),
(23021, 'Drift', 'n.', 'A mass of matter which has been driven or forced onward\n   together in a body, or thrown together in a heap, etc., esp. by wind or\n   water; as, a drift of snow, of ice, of sand, and the like.'),
(23022, 'Drift', 'n.', 'A drove or flock, as of cattle, sheep, birds.'),
(23023, 'Drift', 'n.', 'The horizontal thrust or pressure of an arch or vault upon\n   the abutments.'),
(23024, 'Drift', 'n.', 'A collection of loose earth and rocks, or boulders, which\n   have been distributed over large portions of the earth\'s surface,\n   especially in latitudes north of forty degrees, by the agency of ice.'),
(23025, 'Drift', 'n.', 'In South Africa, a ford in a river.'),
(23026, 'Drift', 'n.', 'A slightly tapered tool of steel for enlarging or shaping a\n   hole in metal, by being forced or driven into or through it; a broach.'),
(23027, 'Drift', 'n.', 'A tool used in driving down compactly the composition\n   contained in a rocket, or like firework.'),
(23028, 'Drift', 'n.', 'A deviation from the line of fire, peculiar to oblong\n   projectiles.'),
(23029, 'Drift', 'n.', 'A passage driven or cut between shaft and shaft; a driftway;\n   a small subterranean gallery; an adit or tunnel.'),
(23030, 'Drift', 'n.', 'The distance through which a current flows in a given time.'),
(23031, 'Drift', 'n.', 'The angle which the line of a ship\'s motion makes with the\n   meridian, in drifting.'),
(23032, 'Drift', 'n.', 'The distance to which a vessel is carried off from her\n   desired course by the wind, currents, or other causes.'),
