(23108, 'Drive', 'v. t.', 'To urge, impel, or hurry forward; to force; to constrain;\n   to urge, press, or bring to a point or state; as, to drive a person by\n   necessity, by persuasion, by force of circumstances, by argument, and\n   the like.'),
