(23271, 'Drowth', 'n.', 'See Drought.'),
(23272, 'Droyle', 'v. i.', 'See Droil.'),
(23273, 'Drubbed', 'imp. & p. p.', 'of Drub'),
(23274, 'Drubbing', 'p. pr. & vb. n.', 'of Drub'),
(23275, 'Drubber', 'n.', 'One who drubs.'),
(23276, 'Drudged', 'imp. & p. p.', 'of Drudge'),
(23277, 'Drudging', 'p. pr. & vb. n.', 'of Drudge'),
(23278, 'Drudge', 'v. i.', 'To perform menial work; to labor in mean or unpleasant\n   offices with toil and fatigue.'),
(23279, 'Drudge', 'v. t.', 'To consume laboriously; -- with away.'),
(23280, 'Drudge', 'n.', 'One who drudges; one who works hard in servile employment;\n   a mental servant.'),
(23281, 'Drudger', 'n.', 'One who drudges; a drudge.'),
(23282, 'Drudger', 'n.', 'A dredging box.'),
(23283, 'Drudgery', 'n.', 'The act of drudging; disagreeable and wearisome labor;\n   ignoble or slavish toil.'),
(23284, 'Druery', 'n.', 'Courtship; gallantry; love; an object of love.'),
(23285, 'Drugged', 'imp. & p. p.', 'of Drug'),
(23286, 'Drugging', 'p. pr. & vb. n.', 'of Drug'),
(23287, 'Drugger', 'n.', 'A druggist.'),
(23288, 'Drugget', 'n.', 'A coarse woolen cloth dyed of one color or printed on one\n   side; generally used as a covering for carpets.'),
(23289, 'Drugget', 'n.', 'By extension, any material used for the same purpose.'),
(23290, 'Druggist', 'n.', 'One who deals in drugs; especially, one who buys and\n   sells drugs without compounding them; also, a pharmaceutist or\n   apothecary.'),
(23291, 'Drugster', 'n.', 'A druggist.'),
(23292, 'Druid', 'n.', 'One of an order of priests which in ancient times existed\n   among certain branches of the Celtic race, especially among the Gauls\n   and Britons.'),
(23293, 'Druid', 'n.', 'A member of a social and benevolent order, founded in London\n   in 1781, and professedly based on the traditions of the ancient Druids.\n   Lodges or groves of the society are established in other countries.'),
(23294, 'Druidess', 'n.', 'A female Druid; a prophetess.'),
(23295, 'Druidic', 'a.', 'Alt. of Druidical'),
(23296, 'Druidish', 'a.', 'Druidic.'),
(23297, 'Druidism', 'n.', 'The system of religion, philosophy, and instruction,\n   received and taught by the Druids; the rites and ceremonies of the\n   Druids.'),
(23298, 'Drummed', 'imp. & p. p.', 'of Drum'),
(23299, 'Drumming', 'p. pr. & vb. n.', 'of Drum'),
(23300, 'Drumbeat', 'n.', 'The sound of a beaten drum; drum music.'),
(23301, 'Drumble', 'v. i.', 'To be sluggish or lazy; to be confused.'),
(23302, 'Drumble', 'v. i.', 'To mumble in speaking.'),
(23303, 'Drumfish', 'n.', 'Any fish of the family Sciaenidae, which makes a loud\n   noise by means of its air bladder; -- called also drum.'),
(23304, 'Drumhead', 'n.', 'The parchment or skin stretched over one end of a drum.'),
(23305, 'Drumhead', 'n.', 'The top of a capstan which is pierced with sockets for\n   levers used in turning it. See Illust. of Capstan.'),
(23306, 'Drumlin', 'n.', 'A hill of compact, unstratified, glacial drift or till,\n   usually elongate or oval, with the larger axis parallel to the former\n   local glacial motion.'),
(23307, 'Drumly', 'a.', 'Turbid; muddy.'),
(23308, 'Drummer', 'n.', 'One whose office is to best the drum, as in military\n   exercises and marching.'),
(23309, 'Drummer', 'n.', 'One who solicits custom; a commercial traveler.'),
(23310, 'Drummer', 'n.', 'A fish that makes a sound when caught'),
(23311, 'Drummer', 'n.', 'The squeteague.'),
(23312, 'Drummer', 'n.', 'A California sculpin.'),
(23313, 'Drummer', 'n.', 'A large West Indian cockroach (Blatta gigantea) which\n   drums on woodwork, as a sexual call.'),
(23314, 'Drumming', 'n.', 'The act of beating upon, or as if upon, a drum; also, the\n   noise which the male of the ruffed grouse makes in spring, by beating\n   his wings upon his sides.'),
(23315, 'Drunk', 'a.', 'Intoxicated with, or as with, strong drink; inebriated;\n   drunken; -- never used attributively, but always predicatively; as, the\n   man is drunk (not, a drunk man).'),
(23316, 'Drunk', 'a.', 'Drenched or saturated with moisture or liquid.'),
(23317, 'Drunk', 'n.', 'A drunken condition; a spree.'),
(23318, 'Drunkard', 'n.', 'One who habitually drinks strong liquors immoderately;\n   one whose habit it is to get drunk; a toper; a sot.'),
(23319, 'Drunken', 'v. i.', 'Overcome by strong drink; intoxicated by, or as by,\n   spirituous liquor; inebriated.'),
(23320, 'Drunken', 'v. i.', 'Saturated with liquid or moisture; drenched.'),
(23321, 'Drunken', 'v. i.', 'Pertaining to, or proceeding from, intoxication.'),
(23322, 'Drupal', 'a.', 'Drupaceous.'),
(23323, 'Drupe', 'n.', 'A fruit consisting of pulpy, coriaceous, or fibrous exocarp,\n   without valves, containing a nut or stone with a kernel. The exocarp is\n   succulent in the plum, cherry, apricot, peach, etc.; dry and\n   subcoriaceous in the almond; and fibrous in the cocoanut.'),
(23324, 'Drupel', 'n.', 'Alt. of Drupelet'),
(23325, 'Drupelet', 'n.', 'A small drupe, as one of the pulpy grains of the\n   blackberry.'),
(23326, 'Druse', 'n.', 'A cavity in a rock, having its interior surface studded with\n   crystals and sometimes filled with water; a geode.'),
(23327, 'Druse', 'n.', 'One of a people and religious sect dwelling chiefly in the\n   Lebanon mountains of Syria.'),
(23328, 'Drusy', 'a.', 'Alt. of Drused'),
(23329, 'Drused', 'a.', 'Covered with a large number of minute crystals.'),
(23330, 'Druxey', 'a.', 'Alt. of Druxy'),
(23331, 'Druxy', 'a.', 'Having decayed spots or streaks of a whitish color; -- said\n   of timber.'),
(23332, 'Dried', 'imp. & p. p.', 'of Dry'),
(23333, 'Drying', 'p. pr. & vb. n.', 'of Dry'),
(23334, 'Dryad', 'n.', 'A wood nymph; a nymph whose life was bound up with that of\n   her tree.'),
(23335, 'Dryandra', 'n.', 'A genus of shrubs growing in Australia, having beautiful,\n   hard, dry, evergreen leaves.'),
(23336, 'Dryades', 'pl. ', 'of Dryas'),
(23337, 'Dryas', 'n.', 'A dryad.'),
(23338, 'Dry-beat', 'v. t.', 'To beat severely.'),
(23339, 'Dry dock', '', 'See under Dock.'),
(23340, 'Dryer', 'n.', 'See Drier.'),
(23341, 'Dry-eyed', 'a.', 'Not having tears in the eyes.'),
(23342, 'Dryfoot', 'n.', 'The scent of the game, as far as it can be traced.'),
(23343, 'Drying', 'a.', 'Adapted or tending to exhaust moisture; as, a drying wind\n   or day; a drying room.'),
(23344, 'Drying', 'a.', 'Having the quality of rapidly becoming dry.'),
(23345, 'Dryly', 'adv.', 'In a dry manner; not succulently; without interest;\n   without sympathy; coldly.'),
(23346, 'Dryness', 'n.', 'The state of being dry. See Dry.'),
(23347, 'Drynurse', 'v. t.', 'To feed, attend, and bring up without the breast.'),
(23348, 'Dry-rub', 'v. t.', 'To rub and cleanse without wetting.'),
(23349, 'Dry-shod', 'a.', 'Without wetting the feet.'),
(23350, 'Dryth', 'n.', 'Alt. of Drith'),
(23351, 'Drith', 'n.', 'Drought.'),
(23352, 'Dualin', 'n.', 'An explosive substance consisting essentially of sawdust or\n   wood pulp, saturated with nitroglycerin and other similar nitro\n   compounds. It is inferior to dynamite, and is more liable to explosion.'),
(23353, 'Dualism', 'n.', 'State of being dual or twofold; a twofold division; any\n   system which is founded on a double principle, or a twofold distinction'),
(23354, 'Dualism', 'n.', 'A view of man as constituted of two original and\n   independent elements, as matter and spirit.'),
(23355, 'Dualism', 'n.', 'A system which accepts two gods, or two original\n   principles, one good and the other evil.'),
(23356, 'Dualism', 'n.', 'The doctrine that all mankind are divided by the arbitrary\n   decree of God, and in his eternal foreknowledge, into two classes, the\n   elect and the reprobate.'),
(23357, 'Dualism', 'n.', 'The theory that each cerebral hemisphere acts\n   independently of the other.'),
(23358, 'Dualist', 'n.', 'One who believes in dualism; a ditheist.'),
(23359, 'Dualist', 'n.', 'One who administers two offices.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(23360, 'Duality', 'n.', 'The quality or condition of being two or twofold; dual\n   character or usage.'),
(23361, 'Duarchy', 'n.', 'Government by two persons.'),
