(23487, 'Dumpish', 'a.', 'Dull; stupid; sad; moping; melancholy.'),
(23488, 'Dumple', 'v. t.', 'To make dumpy; to fold, or bend, as one part over\n   another.'),
(23489, 'Dumpling', 'n.', 'A roundish mass of dough boiled in soup, or as a sort of\n   pudding; often, a cover of paste inclosing an apple or other fruit, and\n   boiled or baked; as, an apple dumpling.'),
(23490, 'Dumpy', 'superl.', 'Short and thick; of low stature and disproportionately\n   stout.'),
