(23516, 'Dunlin', 'n.', 'A species of sandpiper (Tringa alpina); -- called also\n   churr, dorbie, grass bird, and red-backed sandpiper. It is found both\n   in Europe and America.'),
(23517, 'Dunnage', 'n.', 'Fagots, boughs, or loose materials of any kind, laid on\n   the bottom of the hold for the cargo to rest upon to prevent injury by\n   water, or stowed among casks and other cargo to prevent their motion.'),
