(23772, 'Earthnut', 'n.', 'A name given to various roots, tubers, or pods grown\n   under or on the ground'),
(23773, 'Earthnut', 'n.', 'The esculent tubers of the umbelliferous plants Bunium\n   flexuosum and Carum Bulbocastanum.'),
(23774, 'Earthnut', 'n.', 'The peanut. See Peanut.'),
(23775, 'Earthpea', 'n.', 'A species of pea (Amphicarpaea monoica). It is a climbing\n   leguminous plant, with hairy underground pods.'),
(23776, 'Earthy', 'a.', 'Consisting of, or resembling, earth; terrene; earthlike;\n   as, earthy matter.'),
(23777, 'Earthy', 'a.', 'Of or pertaining to the earth or to, this world; earthly;\n   terrestrial; carnal.'),
(23778, 'Earthy', 'a.', 'Gross; low; unrefined.'),
(23779, 'Earthy', 'a.', 'Without luster, or dull and roughish to the touch; as, an\n   earthy fracture.'),
(23780, 'Earwax', 'n.', 'See Cerumen.'),
(23781, 'Earwig', 'n.', 'Any insect of the genus Forticula and related genera,\n   belonging to the order Euplexoptera.'),
(23782, 'Earwig', 'n.', 'In America, any small chilopodous myriapod, esp. of the\n   genus Geophilus.'),
(23783, 'Earwig', 'n.', 'A whisperer of insinuations; a secret counselor.'),
(23784, 'Earwig', 'v. t.', 'To influence, or attempt to influence, by whispered\n   insinuations or private talk.'),
(23785, 'Eased', 'imp. & p. p.', 'of Ease'),
(23786, 'Easing', 'p. pr. & vb. n.', 'of Ease'),
(23787, 'Easeful', 'a.', 'Full of ease; suitable for affording ease or rest; quiet;\n   comfortable; restful.'),
(23788, 'Easel', 'n.', 'A frame (commonly) of wood serving to hold a canvas upright,\n   or nearly upright, for the painter\'s convenience or for exhibition.'),
(23789, 'Easeless', 'a.', 'Without ease.'),
(23790, 'Easement', 'n.', 'That which gives ease, relief, or assistance;\n   convenience; accommodation.'),
(23791, 'Easement', 'n.', 'A liberty, privilege, or advantage, which one proprietor\n   has in the estate of another proprietor, distinct from the ownership of\n   the soil, as a way, water course, etc. It is a species of what the\n   civil law calls servitude.'),
(23792, 'Easement', 'n.', 'A curved member instead of an abrupt change of direction,\n   as in a baseboard, hand rail, etc.'),
(23793, 'Easily', 'adv.', 'With ease; without difficulty or much effort; as, this\n   task may be easily performed; that event might have been easily\n   foreseen.'),
(23794, 'Easily', 'adv.', 'Without pain, anxiety, or disturbance; as, to pass life\n   well and easily.'),
(23795, 'Easily', 'adv.', 'Readily; without reluctance; willingly.'),
(23796, 'Easily', 'adv.', 'Smoothly; quietly; gently; gracefully; without /umult or\n   discord.'),
(23797, 'Easily', 'adv.', 'Without shaking or jolting; commodiously; as, a carriage\n   moves easily.'),
(23798, 'Easiness', 'n.', 'The state or condition of being easy; freedom from\n   distress; rest.'),
(23799, 'Easiness', 'n.', 'Freedom from difficulty; ease; as the easiness of a task.'),
(23800, 'Easiness', 'n.', 'Freedom from emotion; compliance; disposition to yield\n   without opposition; unconcernedness.'),
(23801, 'Easiness', 'n.', 'Freedom from effort, constraint, or formality; -- said of\n   style, manner, etc.'),
(23802, 'Easiness', 'n.', 'Freedom from jolting, jerking, or straining.'),
(23803, 'Easter', 'n.', 'An annual church festival commemorating Christ\'s\n   resurrection, and occurring on Sunday, the second day after Good\n   Friday. It corresponds to the pasha or passover of the Jews, and most\n   nations still give it this name under the various forms of pascha,\n   pasque, paque, or pask.'),
(23804, 'Easter', 'n.', 'The day on which the festival is observed; Easter day.'),
(23805, 'Easter', 'v. i.', 'To veer to the east; -- said of the wind.'),
(23806, 'Easterly', 'a.', 'Coming from the east; as, it was easterly wind.'),
(23807, 'Easterly', 'a.', 'Situated, directed, or moving toward the east; as, the\n   easterly side of a lake; an easterly course or voyage.'),
(23808, 'Easterly', 'adv.', 'Toward, or in the direction of, the east.'),
(23809, 'Eastern', 'a.', 'Situated or dwelling in the east; oriental; as, an eastern\n   gate; Eastern countries.'),
(23810, 'Eastern', 'a.', 'Going toward the east, or in the direction of east; as, an\n   eastern voyage.'),
(23811, 'Easting', 'n.', 'The distance measured toward the east between two\n   meridians drawn through the extremities of a course; distance of\n   departure eastward made by a vessel.'),
(23812, 'Eastward', 'adv.', 'Alt. of Eastwards'),
(23813, 'Eaten', 'p. p.', 'of Eat'),
(23814, 'Eating', 'p. pr. & vb. n.', 'of Eat'),
(23815, 'Eatable', 'a.', 'Capable of being eaten; fit to be eaten; proper for food;\n   esculent; edible.'),
(23816, 'Eatable', 'n.', 'Something fit to be eaten.'),
(23817, 'Eatage', 'n.', 'Eatable growth of grass for horses and cattle, esp. that of\n   aftermath.'),
(23818, 'Eater', 'n.', 'One who, or that which, eats.'),
(23819, 'Eating', 'n.', 'The act of tasking food; the act of consuming or corroding.'),
(23820, 'Eating', 'n.', 'Something fit to be eaten; food; as, a peach is good\n   eating.'),
(23821, 'Eavedrop', 'n.', 'A drop from the eaves; eavesdrop.'),
(23822, 'Eaves', 'n. pl.', 'The edges or lower borders of the roof of a building,\n   which overhang the walls, and cast off the water that falls on the\n   roof.'),
(23823, 'Eaves', 'n. pl.', 'Brow; ridge.'),
(23824, 'Eaves', 'n. pl.', 'Eyelids or eyelashes.'),
(23825, 'Ebbed', 'imp. & p. p.', 'of Ebb'),
(23826, 'Ebbing', 'p. pr. & vb. n.', 'of Ebb'),
(23827, 'Ebb tide', '', 'The reflux of tide water; the retiring tide; -- opposed to\n   flood tide.'),
(23828, 'Ebionite', 'n.', 'One of a sect of heretics, in the first centuries of the\n   church, whose doctrine was a mixture of Judaism and Christianity. They\n   denied the divinity of Christ, regarding him as an inspired messenger,\n   and rejected much of the New Testament.'),
(23829, 'Eblanin', 'n.', 'See Pyroxanthin.'),
(23830, 'Eblis', 'n.', 'The prince of the evil spirits; Satan.'),
(23831, 'Ebonist', 'n.', 'One who works in ebony.'),
(23832, 'Ebonite', 'n.', 'A hard, black variety of vulcanite. It may be cut and\n   polished, and is used for many small articles, as combs and buttons,\n   and for insulating material in electric apparatus.'),
(23833, 'Ebonized', 'imp. & p. p.', 'of Ebonize'),
(23834, 'Ebonize', 'v. t.', 'To make black, or stain black, in imitation of ebony;\n   as, to ebonize wood.'),
(23835, 'Ebonies', 'pl. ', 'of Ebony'),
(23836, 'Ebony', 'n.', 'A hard, heavy, and durable wood, which admits of a fine\n   polish or gloss. The usual color is black, but it also occurs red or\n   green.'),
(23837, 'Ebony', 'a.', 'Made of ebony, or resembling ebony; black; as, an ebony\n   countenance.'),
(23838, 'Ebrauke', 'a.', 'Hebrew.'),
(23839, 'Ebriety', 'n.', 'Drunkenness; intoxication by spirituous liquors;\n   inebriety.'),
(23840, 'Ebrious', 'a.', 'Inclined to drink to excess; intoxicated; tipsy.'),
(23841, 'Eburin', 'n.', 'A composition of dust of ivory or of bone with a cement; --\n   used for imitations of valuable stones and in making moldings, seals,\n   etc.'),
(23842, 'Eburnean', 'a.', 'Made of or relating to ivory.'),
(23843, 'Eburnine', 'a.', 'Of or pertaining to ivory.'),
(23844, 'Ecarte', 'n.', 'A game at cards, played usually by two persons, in which\n   the players may discard any or all of the cards dealt and receive\n   others from the pack.'),
(23845, 'Ecaudate', 'a.', 'Without a tail or spur.'),
(23846, 'Ecaudate', 'a.', 'Tailless.'),
(23847, 'Ecbasis', 'n.', 'A figure in which the orator treats of things according to\n   their events consequences.'),
(23848, 'Ecbatic', 'a.', 'Denoting a mere result or consequence, as distinguished\n   from telic, which denotes intention or purpose; thus the phrase / /, if\n   rendered \"so that it was fulfilled,\" is ecbatic; if rendered \"in order\n   that it might be.\" etc., is telic.'),
(23849, 'Ecbole', 'n.', 'A digression in which a person is introduced speaking his\n   own words.'),
(23850, 'Ecbolic', 'n.', 'A drug, as ergot, which by exciting uterine contractions\n   promotes the expulsion of the contents of the uterus.'),
(23851, 'Ecboline', 'n.', 'An alkaloid constituting the active principle of ergot;\n   -- so named from its power of producing abortion.'),
(23852, 'Eccle', 'n.', 'The European green woodpecker; -- also called ecall,\n   eaquall, yaffle.'),
(23853, 'Ecclesia', 'n.', 'The public legislative assembly of the Athenians.'),
(23854, 'Ecclesia', 'n.', 'A church, either as a body or as a building.'),
(23855, 'Eccritic', 'n.', 'A remedy which promotes discharges, as an emetic, or a\n   cathartic.'),
(23856, 'Ecderon', 'n.', 'See Ecteron.'),
(23857, 'Ecdyses', 'pl. ', 'of Ecdysis'),
(23858, 'Ecdysis', 'n.', 'The act of shedding, or casting off, an outer cuticular\n   layer, as in the case of serpents, lobsters, etc.; a coming out; as,\n   the ecdysis of the pupa from its shell; exuviation.'),
(23859, 'Ecgonine', 'n.', 'A colorless, crystalline, nitrogenous base, obtained by\n   the decomposition of cocaine.'),
(23860, 'Echelon', 'n.', 'An arrangement of a body of troops when its divisions are\n   drawn up in parallel lines each to the right or the left of the one in\n   advance of it, like the steps of a ladder in position for climbing.\n   Also used adjectively; as, echelon distance.'),
(23861, 'Echelon', 'n.', 'An arrangement of a fleet in a wedge or V formation.'),
(23862, 'Echelon', 'v. t.', 'To place in echelon; to station divisions of troops in\n   echelon.'),
(23863, 'Echelon', 'v. i.', 'To take position in echelon.'),
(23864, 'Echidna', 'n.', 'A monster, half maid and half serpent.'),
(23865, 'Echidna', 'n.', 'A genus of Monotremata found in Australia, Tasmania, and\n   New Guinea. They are toothless and covered with spines; -- called also\n   porcupine ant-eater, and Australian ant-eater.'),
(23866, 'Echinate', 'a.', 'Alt. of Echinated'),
(23867, 'Echinid', 'a. & n.', 'Same as Echinoid.'),
(23868, 'Echinite', 'n.', 'A fossil echinoid.'),
(23869, 'Echinoid', 'a.', 'Of or pertaining to the Echinoidea.'),
(23870, 'Echinoid', 'n.', 'One of the Echinoidea.'),
(23871, 'Echini', 'pl. ', 'of Echinus'),
(23872, 'Echinus', 'n.', 'A hedgehog.'),
(23873, 'Echinus', 'n.', 'A genus of echinoderms, including the common edible sea\n   urchin of Europe.'),
(23874, 'Echinus', 'n.', 'The rounded molding forming the bell of the capital of the\n   Grecian Doric style, which is of a peculiar elastic curve. See\n   Entablature.'),
(23875, 'Echinus', 'n.', 'The quarter-round molding (ovolo) of the Roman Doric\n   style. See Illust. of Column'),
(23876, 'Echinus', 'n.', 'A name sometimes given to the egg and anchor or egg and\n   dart molding, because that ornament is often identified with Roman\n   Doric capital. The name probably alludes to the shape of the shell of\n   the sea urchin.'),
(23877, 'Echoes', 'pl. ', 'of Echo'),
(23878, 'Echoed', 'imp. & p. p.', 'of Echo'),
(23879, 'Echoing', 'p. pr. & vb. n.', 'of Echo'),
(23880, 'Echoes', '3d pers. sing. pres.', 'of Echo'),
(23881, 'Echoer', 'n.', 'One who, or that which, echoes.'),
(23882, 'Echoless', 'a.', 'Without echo or response.'),
(23883, 'Echon', 'pron.', 'Alt. of Echoon'),
(23884, 'Echoon', 'pron.', 'Each one.'),
(23885, 'Eclair', 'n.', 'A kind of frosted cake, containing flavored cream.'),
(23886, 'Eclampsy', 'n.', 'Same as Eclampsia.'),
(23887, 'Eclat', 'n.', 'Brilliancy of success or effort; splendor; brilliant show;\n   striking effect; glory; renown.'),
(23888, 'Eclat', 'n.', 'Demonstration of admiration and approbation; applause.'),
(23889, 'Eclectic', 'a.', 'Selecting; choosing (what is true or excellent in\n   doctrines, opinions, etc.) from various sources or systems; as, an\n   eclectic philosopher.'),
(23890, 'Eclectic', 'a.', 'Consisting, or made up, of what is chosen or selected;\n   as, an eclectic method; an eclectic magazine.'),
(23891, 'Eclectic', 'n.', 'One who follows an eclectic method.'),
(23892, 'Eclegm', 'n.', 'A medicine made by mixing oils with sirups.'),
(23893, 'Eclipse', 'n.', 'An interception or obscuration of the light of the sun,\n   moon, or other luminous body, by the intervention of some other body,\n   either between it and the eye, or between the luminous body and that\n   illuminated by it. A lunar eclipse is caused by the moon passing\n   through the earth\'s shadow; a solar eclipse, by the moon coming between\n   the sun and the observer. A satellite is eclipsed by entering the\n   shadow of its primary. The obscuration of a planet or star by the moon\n   or a planet, though of the nature of an eclipse, is called an\n   occultation. The eclipse of a small portion of the sun by Mercury or\n   Venus is called a transit of the planet.'),
(23894, 'Eclipse', 'n.', 'The loss, usually temporary or partial, of light,\n   brilliancy, luster, honor, consciousness, etc.; obscuration; gloom;\n   darkness.'),
(23895, 'Eclipsed', 'imp. & p. p.', 'of Eclipse'),
(23896, 'Eclipse', 'v. t.', 'To cause the obscuration of; to darken or hide; -- said\n   of a heavenly body; as, the moon eclipses the sun.'),
(23897, 'Eclipse', 'v. t.', 'To obscure, darken, or extinguish the beauty, luster,\n   honor, etc., of; to sully; to cloud; to throw into the shade by\n   surpassing.'),
(23898, 'Eclipse', 'v. i.', 'To suffer an eclipse.'),
(23899, 'Ecliptic', 'a.', 'A great circle of the celestial sphere, making an angle\n   with the equinoctial of about 23¡ 28\'. It is the apparent path of the\n   sun, or the real path of the earth as seen from the sun.'),
(23900, 'Ecliptic', 'a.', 'A great circle drawn on a terrestrial globe, making an\n   angle of 23¡ 28\' with the equator; -- used for illustrating and solving\n   astronomical problems.'),
(23901, 'Ecliptic', 'a.', 'Pertaining to the ecliptic; as, the ecliptic way.'),
(23902, 'Ecliptic', 'a.', 'Pertaining to an eclipse or to eclipses.'),
(23903, 'Eclogite', 'n.', 'A rock consisting of granular red garnet, light green\n   smaragdite, and common hornblende; -- so called in reference to its\n   beauty.'),
(23904, 'Eclogue', 'n.', 'A pastoral poem, in which shepherds are introduced\n   conversing with each other; a bucolic; an idyl; as, the Ecloques of\n   Virgil, from which the modern usage of the word has been established.'),
(23905, 'Economic', 'a.', 'Alt. of Economical'),
(23906, 'Economy', 'n.', 'The management of domestic affairs; the regulation and\n   government of household matters; especially as they concern expense or\n   disbursement; as, a careful economy.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(23907, 'Economy', 'n.', 'Orderly arrangement and management of the internal affairs\n   of a state or of any establishment kept up by production and\n   consumption; esp., such management as directly concerns wealth; as,\n   political economy.'),
(23908, 'Economy', 'n.', 'The system of rules and regulations by which anything is\n   managed; orderly system of regulating the distribution and uses of\n   parts, conceived as the result of wise and economical adaptation in the\n   author, whether human or divine; as, the animal or vegetable economy;\n   the economy of a poem; the Jewish economy.'),
(23909, 'Economy', 'n.', 'Thrifty and frugal housekeeping; management without loss\n   or waste; frugality in expenditure; prudence and disposition to save;\n   as, a housekeeper accustomed to economy but not to parsimony.'),
(23910, 'Ecorche', 'n.', 'A manikin, or image, representing an animal, especially\n   man, with the skin removed so that the muscles are exposed for purposes\n   of study.'),
(23911, 'Ecostate', 'a.', 'Having no ribs or nerves; -- said of a leaf.'),
(23912, 'Ecoute', 'n.', 'One of the small galleries run out in front of the glacis.\n   They serve to annoy the enemy\'s miners.'),
(23913, 'Ecphasis', 'n.', 'An explicit declaration.'),
(23914, 'Ecraseur', 'n.', 'An instrument intended to replace the knife in many\n   operations, the parts operated on being severed by the crushing effect\n   produced by the gradual tightening of a steel chain, so that hemorrhage\n   rarely follows.'),
(23915, 'Ecstasy', 'n.', 'The state of being beside one\'s self or rapt out of one\'s\n   self; a state in which the mind is elevated above the reach of ordinary\n   impressions, as when under the influence of overpowering emotion; an\n   extraordinary elevation of the spirit, as when the soul, unconscious of\n   sensible objects, is supposed to contemplate heavenly mysteries.'),
(23916, 'Ecstasy', 'n.', 'Excessive and overmastering joy or enthusiasm; rapture;\n   enthusiastic delight.'),
(23917, 'Ecstasy', 'n.', 'Violent distraction of mind; violent emotion; excessive\n   grief of anxiety; insanity; madness.'),
(23918, 'Ecstasy', 'n.', 'A state which consists in total suspension of sensibility,\n   of voluntary motion, and largely of mental power. The body is erect and\n   inflexible; the pulsation and breathing are not affected.'),
(23919, 'Ecstasy', 'v. t.', 'To fill ecstasy, or with rapture or enthusiasm.'),
(23920, 'Ecstatic', 'n.', 'Pertaining to, or caused by, ecstasy or excessive\n   emotion; of the nature, or in a state, of ecstasy; as, ecstatic gaze;\n   ecstatic trance.'),
(23921, 'Ecstatic', 'n.', 'Delightful beyond measure; rapturous; ravishing; as,\n   ecstatic bliss or joy.'),
(23922, 'Ecstatic', 'n.', 'An enthusiast.'),
(23923, 'Ecto-', '', 'A combining form signifying without, outside, external.'),
(23924, 'Ectad', 'adv.', 'Toward the outside or surface; -- opposed to entad.'),
(23925, 'Ectal', 'a.', 'Pertaining to, or situated near, the surface; outer; --\n   opposed to ental.'),
(23926, 'Ectasia', 'n.', 'A dilatation of a hollow organ or of a canal.'),
(23927, 'Ectasis', 'n.', 'The lengthening of a syllable from short to long.'),
(23928, 'Ectental', 'a.', 'Relating to, or connected with, the two primitive germ\n   layers, the ectoderm and ectoderm; as, the \"ectental line\" or line of\n   juncture of the two layers in the segmentation of the ovum.'),
(23929, 'Ecteron', 'n.', 'The external layer of the skin and mucous membranes;\n   epithelium; ecderon.'),
(23930, 'Ecthorea', 'pl. ', 'of Ecthoreum'),
(23931, 'Ecthyma', 'n.', 'A cutaneous eruption, consisting of large, round pustules,\n   upon an indurated and inflamed base.'),
(23932, 'Ecto-', '', 'See Ect-.'),
(23933, 'Ectocyst', 'n.', 'The outside covering of the Bryozoa.'),
(23934, 'Ectoderm', 'n.', 'The outer layer of the blastoderm; epiblast.'),
(23935, 'Ectoderm', 'n.', 'The external skin or outer layer of an animal or plant,\n   this being formed in an animal from the epiblast. See Illust. of\n   Blastoderm.'),
(23936, 'Ectomere', 'n.', 'The more transparent cells, which finally become\n   external, in many segmenting ova, as those of mammals.'),
(23937, 'Ectopia', 'n.', 'A morbid displacement of parts, especially such as is\n   congenial; as, ectopia of the heart, or of the bladder.'),
(23938, 'Ectopic', 'a.', 'Out of place; congenitally displaced; as, an ectopic\n   organ.'),
(23939, 'Ectopy', 'n.', 'Same as Ectopia.'),
(23940, 'Ectosarc', 'n.', 'The semisolid external layer of protoplasm in some\n   unicellular organisms, as the amoeba; ectoplasm; exoplasm.'),
(23941, 'Ectozoic', 'a.', 'See Epizoic.'),
(23942, 'Ectozoa', 'pl. ', 'of Ectozoon'),
(23943, 'Ectozoon', 'n.', 'See Epizoon.'),
(23944, 'Ectrotic', 'a.', 'Having a tendency to prevent the development of anything,\n   especially of a disease.'),
(23945, 'Ectypal', 'a.', 'Copied, reproduced as a molding or cast, in\n   contradistinction from the original model.'),
(23946, 'Ectype', 'n.', 'A copy, as in pottery, of an artist\'s original work. Hence:'),
(23947, 'Ectype', 'n.', 'A work sculptured in relief, as a cameo, or in bas-relief\n   (in this sense used loosely).'),
(23948, 'Ectype', 'n.', 'A copy from an original; a type of something that has\n   previously existed.'),
(23949, 'Ecumenic', 'a.', 'Alt. of Ecumenical'),
(23950, 'Ecurie', 'n.', 'A stable.'),
(23951, 'Eczema', 'n.', 'An inflammatory disease of the skin, characterized by the\n   presence of redness and itching, an eruption of small vesicles, and the\n   discharge of a watery exudation, which often dries up, leaving the skin\n   covered with crusts; -- called also tetter, milk crust, and salt rheum.'),
(23952, 'Edacious', 'a.', 'Given to eating; voracious; devouring.'),
(23953, 'Edacity', 'n.', 'Greediness; voracity; ravenousness; rapacity.'),
(23954, 'Eddas', 'pl. ', 'of Edda'),
(23955, 'Eddaic', 'a.', 'Alt. of Eddic'),
(23956, 'Eddic', 'a.', 'Relating to the Eddas; resembling the Eddas.'),
(23957, 'Edder', 'n.', 'An adder or serpent.'),
(23958, 'Edder', 'n.', 'Flexible wood worked into the top of hedge stakes, to bind\n   them together.'),
(23959, 'Edder', 'v. t.', 'To bind the top interweaving edder; as, to edder a hedge.'),
(23960, 'Eddish', 'n.', 'Aftermath; also, stubble and stubble field. See Arrish.'),
(23961, 'Eddoes', 'n. pl.', 'The tubers of Colocasia antiquorum. See Taro.'),
(23962, 'Eddies', 'pl. ', 'of Eddy'),
(23963, 'Eddied', 'imp. & p. p.', 'of Eddy'),
(23964, 'Eddying', 'p. pr. & vb. n.', 'of Eddy'),
(23965, 'Edema', 'n.', 'Same as oedema.'),
(23966, 'Edenic', 'a.', 'Of or pertaining to Eden; paradisaic.'),
(23967, 'Edenite', 'n.', 'A variety of amphibole. See Amphibole.'),
(23968, 'Edenized', 'a.', 'Admitted to a state of paradisaic happiness.'),
(23969, 'Edental', 'a.', 'See Edentate, a.'),
(23970, 'Edental', 'n.', 'One of the Edentata.'),
(23971, 'Edentata', 'n. pl.', 'An order of mammals including the armadillos, sloths,\n   and anteaters; -- called also Bruta. The incisor teeth are rarely\n   developed, and in some groups all the teeth are lacking.'),
(23972, 'Edentate', 'a.', 'Destitute of teeth; as, an edentate quadruped; an\n   edentate leaf.'),
(23973, 'Edentate', 'a.', 'Belonging to the Edentata.'),
(23974, 'Edentate', 'n.', 'One of the Edentata.'),
(23975, 'Edged', 'imp. & p. p.', 'of Edge'),
(23976, 'Edging', 'p. pr. & vb. n.', 'of Edge'),
(23977, 'Edgebone', 'n.', 'Same as Aitchbone.'),
(23978, 'Edgeless', 'a.', 'Without an edge; not sharp; blunt; obtuse; as, an\n   edgeless sword or weapon.'),
(23979, 'Edgelong', 'adv.', 'In the direction of the edge.'),
(23980, 'Edgeshot', 'a.', 'Having an edge planed, -- said of a board.'),
(23981, 'Edgeways', 'adv.', 'Alt. of Edgewise'),
(23982, 'Edgewise', 'adv.', 'With the edge towards anything; in the direction of the\n   edge.'),
(23983, 'Edging', 'n.', 'That which forms an edge or border, as the fringe,\n   trimming, etc., of a garment, or a border in a garden.'),
(23984, 'Edging', 'n.', 'The operation of shaping or dressing the edge of anything,\n   as of a piece of metal.'),
(23985, 'Edgingly', 'adv.', 'Gradually; gingerly.'),
(23986, 'Edible', 'a.', 'Fit to be eaten as food; eatable; esculent; as, edible\n   fishes.'),
(23987, 'Edible', 'n.', 'Anything edible.'),
(23988, 'Edict', 'n.', 'A public command or ordinance by the sovereign power; the\n   proclamation of a law made by an absolute authority, as if by the very\n   act of announcement; a decree; as, the edicts of the Roman emperors;\n   the edicts of the French monarch.'),
(23989, 'Edictal', 'a.', 'Relating to, or consisting of, edicts; as, the Roman\n   edictal law.'),
(23990, 'Edifice', 'n.', 'A building; a structure; an architectural fabric; --\n   chiefly applied to elegant houses, and other large buildings; as, a\n   palace, a church, a statehouse.'),
(23991, 'Edifier', 'n.', 'One who builds.'),
(23992, 'Edifier', 'n.', 'One who edifies, builds up, or strengthens another by\n   moral or religious instruction.'),
(23993, 'Edified', 'imp. & p. p.', 'of Edify'),
(23994, 'Edifying', 'p. pr. & vb. n.', 'of Edify'),
(23995, 'Edify', 'v. i.', 'To build; to construct.'),
(23996, 'Edify', 'v. i.', 'To instruct and improve, especially in moral and\n   religious knowledge; to teach.'),
(23997, 'Edify', 'v. i.', 'To teach or persuade.'),
(23998, 'Edify', 'v. i.', 'To improve.'),
(23999, 'Edifying', 'a.', 'Instructing; improving; as, an edifying conversation.'),
(24000, 'Edile', 'n.', 'See Aedile.'),
(24001, 'Edited', 'imp. & p. p.', 'of Edit'),
(24002, 'Editing', 'p. pr. & vb. n.', 'of Edit'),
(24003, 'Edition', 'n.', 'A literary work edited and published, as by a certain\n   editor or in a certain manner; as, a good edition of Chaucer; Chalmers\'\n   edition of Shakespeare.'),
(24004, 'Edition', 'n.', 'The whole number of copies of a work printed and published\n   at one time; as, the first edition was soon sold.'),
(24005, 'Editor', 'n.', 'One who edits; esp., a person who prepares, superintends,\n   revises, and corrects a book, magazine, or newspaper, etc., for\n   publication.'),
(24006, 'Editress', 'n.', 'A female editor.'),
(24007, 'Edituate', 'v. t.', 'To guard as a churchwarden does.'),
(24008, 'Edomite', 'n.', 'One of the descendants of Esau or Edom, the brother of\n   Jacob; an Idumean.'),
(24009, 'Educable', 'a.', 'Capable of being educated.'),
(24010, 'Educated', 'imp. & p. p.', 'of Educate'),
(24011, 'Educate', 'v. t.', 'To bring /// or guide the powers of, as a child; to\n   develop and cultivate, whether physically, mentally, or morally, but\n   more commonly limited to the mental activities or senses; to expand,\n   strengthen, and discipline, as the mind, a faculty, etc.,; to form and\n   regulate the principles and character of; to prepare and fit for any\n   calling or business by systematic instruction; to cultivate; to train;\n   to instruct; as, to educate a child; to educate the eye or the taste.'),
(24012, 'Educated', 'a.', 'Formed or developed by education; as, an educated man.'),
(24013, 'Educator', 'n.', 'One who educates; a teacher.'),
(24014, 'Educed', 'imp. & p. p.', 'of Educe'),
(24015, 'Educing', 'p. pr. & vb. n.', 'of Educe'),
(24016, 'Educe', 'v. t.', 'To bring or draw out; to cause to appear; to produce\n   against counter agency or influence; to extract; to evolve; as, to\n   educe a form from matter.'),
(24017, 'Educible', 'a.', 'Capable of being educed.'),
(24018, 'Educt', 'n.', 'That which is educed, as by analysis.'),
(24019, 'Eduction', 'n.', 'The act of drawing out or bringing into view.'),
(24020, 'Eductive', 'a.', 'Tending to draw out; extractive.'),
(24021, 'Eductor', 'n.', 'One who, or that which, brings forth, elicits, or\n   extracts.'),
(24022, 'Edulious', 'a.', 'Edible.'),
(24023, 'Eelbuck', 'n.', 'An eelpot or eel basket.'),
(24024, 'Eelfare', 'n.', 'A brood of eels.'),
(24025, 'Eelgrass', 'n.', 'A plant (Zostera marina), with very long and narrow\n   leaves, growing abundantly in shallow bays along the North Atlantic\n   coast.'),
(24026, 'Eelpot', 'n.', 'A boxlike structure with funnel-shaped traps for catching\n   eels; an eelbuck.'),
(24027, 'Eelpout', 'n.', 'A European fish (Zoarces viviparus), remarkable for\n   producing living young; -- called also greenbone, guffer, bard, and\n   Maroona eel. Also, an American species (Z. anguillaris), -- called also\n   mutton fish, and, erroneously, congo eel, ling, and lamper eel. Both\n   are edible, but of little value.'),
(24028, 'Eelpout', 'n.', 'A fresh-water fish, the burbot.'),
(24029, 'Eelspear', 'n.', 'A spear with barbed forks for spearing eels.'),
(24030, 'Eerie', 'a.', 'Alt. of Eery'),
(24031, 'Eerily', 'adv.', 'In a strange, unearthly way.'),
(24032, 'Eerisome', 'a.', 'Causing fear; eerie.'),
(24033, 'Effable', 'a.', 'Capable of being uttered or explained; utterable.'),
(24034, 'Effaced', 'imp. & p. p.', 'of Efface'),
(24035, 'Effacing', 'p. pr. & vb. n.', 'of Efface'),
(24036, 'Efface', 'v. t.', 'To cause to disappear (as anything impresses or\n   inscribed upon a surface) by rubbing out, striking out, etc.; to erase;\n   to render illegible or indiscernible; as, to efface the letters on a\n   monument, or the inscription on a coin.'),
(24037, 'Efface', 'v. t.', 'To destroy, as a mental impression; to wear away.'),
(24038, 'Effect', 'n.', 'Execution; performance; realization; operation; as, the law\n   goes into effect in May.'),
(24039, 'Effect', 'n.', 'Manifestation; expression; sign.'),
(24040, 'Effect', 'n.', 'In general: That which is produced by an agent or cause;\n   the event which follows immediately from an antecedent, called the\n   cause; result; consequence; outcome; fruit; as, the effect of luxury.'),
(24041, 'Effect', 'n.', 'Impression left on the mind; sensation produced.'),
(24042, 'Effect', 'n.', 'Power to produce results; efficiency; force; importance;\n   account; as, to speak with effect.'),
(24043, 'Effect', 'n.', 'Consequence intended; purpose; meaning; general intent; --\n   with to.'),
(24044, 'Effect', 'n.', 'The purport; the sum and substance.'),
(24045, 'Effect', 'n.', 'Reality; actual meaning; fact, as distinguished from mere\n   appearance.'),
(24046, 'Effect', 'n.', 'Goods; movables; personal estate; -- sometimes used to\n   embrace real as well as personal property; as, the people escaped from\n   the town with their effects.'),
(24047, 'Effected', 'imp. & p. p.', 'of Effect'),
(24048, 'Effect', 'v. t.', 'To produce, as a cause or agent; to cause to be.'),
(24049, 'Effect', 'v. t.', 'To bring to pass; to execute; to enforce; to achieve; to\n   accomplish.'),
(24050, 'Effecter', 'n.', 'One who effects.'),
(24051, 'Effector', 'n.', 'An effecter.'),
(24052, 'Effendi', 'n.', 'Master; sir; -- a title of a Turkish state official and\n   man of learning, especially one learned in the law.'),
(24053, 'Efferent', 'a.', 'Conveying outward, or discharging; -- applied to certain\n   blood vessels, lymphatics, nerves, etc.'),
(24054, 'Efferent', 'a.', 'Conveyed outward; as, efferent impulses, i. e., such as\n   are conveyed by the motor or efferent nerves from the central nervous\n   organ outwards; -- opposed to afferent.'),
(24055, 'Efferent', 'n.', 'An efferent duct or stream.'),
(24056, 'Efferous', 'a.', 'Like a wild beast; fierce.'),
(24057, 'Effet', 'n.', 'The common newt; -- called also asker, eft, evat, and ewt.'),
(24058, 'Effete', 'a.', 'No longer capable of producing young, as an animal, or\n   fruit, as the earth; hence, worn out with age; exhausted of energy;\n   incapable of efficient action; no longer productive; barren; sterile.'),
(24059, 'Efficacy', 'n.', 'Power to produce effects; operation or energy of an agent\n   or force; production of the effect intended; as, the efficacy of\n   medicine in counteracting disease; the efficacy of prayer.'),
(24060, 'Effierce', 'v. t.', 'To make fierce.'),
(24061, 'Effigial', 'a.', 'Relating to an effigy.'),
(24062, 'Effigies', 'n.', 'See Effigy.'),
(24063, 'Effigies', 'pl. ', 'of Effigy'),
(24064, 'Effigy', 'n.', 'The image, likeness, or representation of a person, whether\n   a full figure, or a part; an imitative figure; -- commonly applied to\n   sculptured likenesses, as those on monuments, or to those of the heads\n   of princes on coins and medals, sometimes applied to portraits.'),
(24065, 'Efflate', 'v. t.', 'To fill with breath; to puff up.'),
(24066, 'Efflower', 'v. t.', 'To remove the epidermis of (a skin) with a concave\n   knife, blunt in its middle part, -- as in making chamois leather.'),
(24067, 'Effluent', 'a.', 'Flowing out; as, effluent beams.'),
(24068, 'Effluent', 'n.', 'A stream that flows out of another stream or lake.'),
(24069, 'Effluvia', 'pl. ', 'of Effluvium'),
(24070, 'Efflux', 'n.', 'The act or process of flowing out, or issuing forth;\n   effusion; outflow; as, the efflux of matter from an ulcer; the efflux\n   of men\'s piety.'),
(24071, 'Efflux', 'n.', 'That which flows out; emanation; effluence.'),
(24072, 'Efflux', 'v. i.', 'To run out; to flow forth; to pass away.'),
(24073, 'Efforced', 'imp. & p. p.', 'of Efforce'),
(24074, 'Efforce', 'v. t.', 'To force; to constrain; to compel to yield.'),
(24075, 'Efform', 'v. t.', 'To form; to shape.'),
(24076, 'Effort', 'n.', 'An exertion of strength or power, whether physical or\n   mental, in performing an act or aiming at an object; more or less\n   strenuous endeavor; struggle directed to the accomplishment of an\n   object; as, an effort to scale a wall.'),
(24077, 'Effort', 'n.', 'A force acting on a body in the direction of its motion.'),
(24078, 'Effort', 'v. t.', 'To stimulate.'),
(24079, 'Effray', 'v. t.', 'To frighten; to scare.'),
(24080, 'Effront', 'v. t.', 'To give assurance to.'),
(24081, 'Effulged', 'imp. & p. p.', 'of Effulge'),
(24082, 'Effulge', 'v. t.', 'To cause to shine with abundance of light; to radiate;\n   to beam.'),
(24083, 'Effulge', 'v. i.', 'To shine forth; to beam.'),
(24084, 'Effume', 'v. t.', 'To breathe or puff out.'),
(24085, 'Effund', 'v. t.', 'To pour out.'),
(24086, 'Effuse', 'a.', 'Poured out freely; profuse.'),
(24087, 'Effuse', 'a.', 'Disposed to pour out freely; prodigal.'),
(24088, 'Effuse', 'a.', 'Spreading loosely, especially on one side; as, an effuse\n   inflorescence.'),
(24089, 'Effuse', 'a.', 'Having the lips, or edges, of the aperture abruptly\n   spreading; -- said of certain shells.'),
(24090, 'Effuse', 'n.', 'Effusion; loss.'),
(24091, 'Effused', 'imp. & p. p.', 'of Effuse'),
(24092, 'Effusing', 'p. pr. & vb. n.', 'of Effuse'),
(24093, 'Effuse', 'v. t.', 'To pour out like a stream or freely; to cause to exude;\n   to shed.'),
(24094, 'Effuse', 'v. i.', 'To emanate; to issue.'),
(24095, 'Effusion', 'n.', 'The act of pouring out; as, effusion of water, of blood,\n   of grace, of words, and the like.'),
(24096, 'Effusion', 'n.', 'That which is poured out, literally or figuratively.'),
(24097, 'Effusion', 'n.', 'The escape of a fluid out of its natural vessel, either\n   by rupture of the vessel, or by exudation through its walls. It may\n   pass into the substance of an organ, or issue upon a free surface.'),
(24098, 'Effusion', 'n.', 'The liquid escaping or exuded.'),
(24099, 'Effusive', 'a.', 'Pouring out; pouring forth freely.'),
(24100, 'Efreet', 'n.', 'See Afrit.'),
(24101, 'Eftsoon', 'adv.', 'Alt. of Eftsoons'),
(24102, 'Eftsoons', 'adv.', 'Again; anew; a second time; at once; speedily.'),
(24103, 'Egality', 'n.', 'Equality.'),
(24104, 'Egean', 'a.', 'See Aegean.'),
(24105, 'Egence', 'n.', 'The state of needing, or of suffering a natural want.'),
(24106, 'Egest', 'v. t.', 'To cast or throw out; to void, as excrement; to excrete,\n   as the indigestible matter of the food; in an extended sense, to\n   excrete by the lungs, skin, or kidneys.'),
(24107, 'Egesta', 'n. pl.', 'That which is egested or thrown off from the body by\n   the various excretory channels; excrements; -- opposed to ingesta.'),
(24108, 'Egestion', 'n.', 'Act or process of egesting; a voiding.'),
(24109, 'Egged', 'imp. & p. p.', 'of Egg'),
(24110, 'Egging', 'p. pr. & vb. n.', 'of Egg'),
(24111, 'Eggar', 'n.', 'Any bombycid moth of the genera Eriogaster and Lasiocampa;\n   as, the oak eggar (L. roboris) of Europe.'),
(24112, 'Egg-bird', 'n.', 'A species of tern, esp. the sooty tern (Sterna\n   fuliginosa) of the West Indies. In the Bahama Islands the name is\n   applied to the tropic bird, Phaethon flavirostris.'),
(24113, 'Egg-cup', 'n.', 'A cup used for holding an egg, at table.'),
(24114, 'Eggement', 'n.', 'Instigation; incitement.'),
(24115, 'Egger', 'n.', 'One who gathers eggs; an eggler.'),
(24116, 'Egger', 'v. t.', 'One who eggs or incites.'),
(24117, 'Eggery', 'n.', 'A place where eggs are deposited (as by sea birds) or kept;\n   a nest of eggs.'),
(24118, 'Egghot', 'n.', 'A kind of posset made of eggs, brandy, sugar, and ale.'),
(24119, 'Eggler', 'n.', 'One who gathers, or deals in, eggs.'),
(24120, 'Eggnog', 'n.', 'A drink consisting of eggs beaten up with sugar, milk, and\n   (usually) wine or spirits.'),
(24121, 'Eggplant', 'n.', 'A plant (Solanum Melongena), of East Indian origin,\n   allied to the tomato, and bearing a large, smooth, edible fruit, shaped\n   somewhat like an egg; mad-apple.'),
(24122, 'Eggshell', 'n.', 'The shell or exterior covering of an egg. Also used\n   figuratively for anything resembling an eggshell.'),
(24123, 'Eggshell', 'n.', 'A smooth, white, marine, gastropod shell of the genus\n   Ovulum, resembling an egg in form.'),
(24124, 'Eghen', 'n. pl.', 'Eyes.'),
(24125, 'Egilops', 'n.', 'See Aegilops.'),
(24126, 'Eglatere', 'n.', 'Eglantine.'),
(24127, 'Egling', 'n.', 'The European perch when two years old.'),
(24128, 'Egoical', 'a.', 'Pertaining to egoism.'),
(24129, 'Egoism', 'n.', 'The doctrine of certain extreme adherents or disciples of\n   Descartes and Johann Gottlieb Fichte, which finds all the elements of\n   knowledge in the ego and the relations which it implies or provides\n   for.'),
(24130, 'Egoism', 'n.', 'Excessive love and thought of self; the habit of regarding\n   one\'s self as the center of every interest; selfishness; -- opposed to\n   altruism.'),
(24131, 'Egoist', 'n.', 'One given overmuch to egoism or thoughts of self.'),
(24132, 'Egoist', 'n.', 'A believer in egoism.'),
(24133, 'Egoistic', 'a.', 'Alt. of Egoistical'),
(24134, 'Egoity', 'n.', 'Personality.'),
(24135, 'Egomism', 'n.', 'Egoism.'),
(24136, 'Egophony', 'n.', 'The sound of a patient\'s voice so modified as to resemble\n   the bleating of a goat, heard on applying the ear to the chest in\n   certain diseases within its cavity, as in pleurisy with effusion.'),
(24137, 'Egotism', 'n.', 'The practice of too frequently using the word I; hence, a\n   speaking or writing overmuch of one\'s self; self-exaltation;\n   self-praise; the act or practice of magnifying one\'s self or parading\n   one\'s own doings. The word is also used in the sense of egoism.'),
(24138, 'Egotist', 'n.', 'One addicted to egotism; one who speaks much of himself or\n   magnifies his own achievements or affairs.'),
(24139, 'Egotized', 'imp. & p. p.', 'of Egotize'),
(24140, 'Egotize', 'v. i.', 'To talk or write as an egotist.'),
(24141, 'Egremoin', 'n.', 'Agrimony (Agrimonia Eupatoria).'),
(24142, 'Egress', 'n.', 'The act of going out or leaving, or the power to leave;\n   departure.'),
(24143, 'Egress', 'n.', 'The passing off from the sun\'s disk of an inferior planet,\n   in a transit.'),
(24144, 'Egress', 'v. i.', 'To go out; to depart; to leave.'),
(24145, 'Egressor', 'n.', 'One who goes out.'),
(24146, 'Egret', 'n.', 'The name of several species of herons which bear plumes on\n   the back. They are generally white. Among the best known species are\n   the American egret (Ardea, / Herodias, egretta); the great egret (A.\n   alba); the little egret (A. garzetta), of Europe; and the American\n   snowy egret (A. candidissima).'),
(24147, 'Egret', 'n.', 'A plume or tuft of feathers worn as a part of a headdress,\n   or anything imitating such an ornament; an aigrette.'),
(24148, 'Egret', 'n.', 'The flying feathery or hairy crown of seeds or achenes, as\n   the down of the thistle.'),
(24149, 'Egret', 'n.', 'A kind of ape.'),
(24150, 'Egrette', 'n.', 'Same as Egret, n., 2.'),
(24151, 'Egrimony', '', 'The herb agrimony.'),
(24152, 'Egrimony', 'n.', 'Sorrow.'),
(24153, 'Egriot', 'n.', 'A kind of sour cherry.'),
(24154, 'Egritude', 'n.', 'Sickness; ailment; sorrow.'),
(24155, 'Egyptian', 'a.', 'Pertaining to Egypt, in Africa.'),
(24156, 'Egyptian', 'n.', 'A native, or one of the people, of Egypt; also, the\n   Egyptian language.'),
(24157, 'Egyptian', 'n.', 'A gypsy.'),
(24158, 'Egyptize', 'v. t.', 'To give an Egyptian character or appearance to.'),
(24159, 'Ehlite', 'n.', 'A mineral of a green color and pearly luster; a hydrous\n   phosphate of copper.'),
(24160, 'Eider', 'n.', 'Any species of sea duck of the genus Somateria, esp.\n   Somateria mollissima, which breeds in the northern parts of Europe and\n   America, and lines its nest with fine down (taken from its own body)\n   which is an article of commerce; -- called also eider duck. The\n   American eider (S. Dresseri), the king eider (S. spectabilis), and the\n   spectacled eider (Arctonetta Fischeri) are related species.'),
(24161, 'Eidolon', 'n.', 'An image or representation; a form; a phantom; an\n   apparition.'),
(24162, 'Eight', 'n.', 'An island in a river; an ait.'),
(24163, 'Eight', 'a.', 'Seven and one; as, eight years.'),
(24164, 'Eight', 'n.', 'The number greater by a unit than seven; eight units or\n   objects.'),
(24165, 'Eight', 'n.', 'A symbol representing eight units, as 8 or viii.'),
(24166, 'Eighteen', 'a.', 'Eight and ten; as, eighteen pounds.'),
(24167, 'Eighteen', 'n.', 'The number greater by a unit than seventeen; eighteen\n   units or objects.'),
(24168, 'Eighteen', 'n.', 'A symbol denoting eighteen units, as 18 or xviii.'),
(24169, 'Eighth', 'a.', 'Next in order after the seventh.'),
(24170, 'Eighth', 'a.', 'Consisting of one of eight equal divisions of a thing.'),
(24171, 'Eighth', 'n.', 'The quotient of a unit divided by eight; one of eight equal\n   parts; an eighth part.'),
(24172, 'Eighth', 'n.', 'The interval of an octave.'),
(24173, 'Eighthly', 'adv.', 'As the eighth in order.'),
(24174, 'Eighty', 'a.', 'Eight times ten; fourscore.'),
(24175, 'Eighty', 'n.', 'The sum of eight times ten; eighty units or objects.'),
(24176, 'Eighty', 'n.', 'A symbol representing eighty units, or ten eight times\n   repeated, as 80 or lxxx.'),
(24177, 'Eigne', 'a.', 'Eldest; firstborn.'),
(24178, 'Eigne', 'a.', 'Entailed; belonging to the eldest son.'),
(24179, 'Eiking', 'n.', 'See Eking.'),
(24180, 'Eikon', 'n.', 'An image or effigy; -- used rather in an abstract sense, and\n   rarely for a work of art.'),
(24181, 'Eikosane', 'n.', 'A solid hydrocarbon, C20H42, of the paraffine series, of\n   artificial production, and also probably occurring in petroleum.'),
(24182, 'Eirenic', 'a.', 'Pacific. See Irenic.'),
(24183, 'Eirie', 'n.', 'See Aerie, and Eyrie.'),
(24184, 'Eisel', 'n.', 'Vinegar; verjuice.'),
(24185, 'Either', 'a. & pron.', 'One of two; the one or the other; -- properly used\n   of two things, but sometimes of a larger number, for any one.'),
(24186, 'Either', 'a. & pron.', 'Each of two; the one and the other; both; --\n   formerly, also, each of any number.'),
(24187, 'Either', 'conj. Either', 'precedes two, or more, coordinate words or\n   phrases, and is introductory to an alternative. It is correlative to\n   or.'),
(24188, 'Ejected', 'imp. & p. p.', 'of Eject'),
(24189, 'Ejecting', 'p. pr. & vb. n.', 'of Eject'),
(24190, 'Eject', 'v. t.', 'To expel; to dismiss; to cast forth; to thrust or drive\n   out; to discharge; as, to eject a person from a room; to eject a\n   traitor from the country; to eject words from the language.'),
(24191, 'Eject', 'v. t.', 'To cast out; to evict; to dispossess; as, to eject\n   tenants from an estate.'),
(24192, 'Ejection', 'n.', 'The act of ejecting or casting out; discharge; expulsion;\n   evacuation.'),
(24193, 'Ejection', 'n.', 'The act or process of discharging anything from the body,\n   particularly the excretions.'),
(24194, 'Ejection', 'n.', 'The state of being ejected or cast out; dispossession;\n   banishment.'),
(24195, 'Ejector', 'n.', 'One who, or that which, ejects or dispossesses.'),
(24196, 'Ejector', 'n.', 'A jet jump for lifting water or withdrawing air from a\n   space.'),
(24197, 'Ekabor', 'n.', 'Alt. of Ekaboron'),
(24198, 'Ekaboron', 'n.', 'The name given by Mendelejeff in accordance with the\n   periodic law, and by prediction, to a hypothetical element then\n   unknown, but since discovered and named scandium; -- so called because\n   it was a missing analogue of the boron group. See Scandium.'),
(24199, 'Eking', 'p. pr. & vb. n.', 'of Eke'),
(24200, 'Ekename', 'n.', 'An additional or epithet name; a nickname.'),
(24201, 'Eking', 'v. t.', 'A lengthening or filling piece to make good a deficiency\n   in length.'),
(24202, 'Eking', 'v. t.', 'The carved work under the quarter piece at the aft part\n   of the quarter gallery.'),
(24203, 'Elaeis', 'n.', 'A genus of palms.'),
(24204, 'Elaidate', 'n.', 'A salt of elaidic acid.'),
(24205, 'Elaidic', 'a.', 'Relating to oleic acid, or elaine.'),
(24206, 'Elaidin', 'n.', 'A solid isomeric modification of olein.'),
(24207, 'Elaine', 'n.', 'Alt. of Elain'),
(24208, 'Elain', 'n.', 'Same as Olein.'),
(24209, 'Elaiodic', 'a.', 'Derived from castor oil; ricinoleic; as, elaiodic acid.'),
(24210, 'Elamite', 'n.', 'A dweller in Flam (or Susiana), an ancient kingdom of\n   Southwestern Asia, afterwards a province of Persia.'),
(24211, 'Elamping', 'a.', 'Shining.'),
(24212, 'Elanced', 'imp. & p. p.', 'of Elance'),
(24213, 'Elancing', 'p. pr. & vb. n.', 'of Elance'),
(24214, 'Elance', 'v. t.', 'To throw as a lance; to hurl; to dart.'),
(24215, 'Eland', 'n.', 'A species of large South African antelope (Oreas canna). It\n   is valued both for its hide and flesh, and is rapidly disappearing in\n   the settled districts; -- called also Cape elk.'),
(24216, 'Eland', 'n.', 'The elk or moose.'),
(24217, 'Elanet', 'n.', 'A kite of the genus Elanus.'),
(24218, 'Elaolite', 'n.', 'See Elaeolite.'),
(24219, 'Elaphine', 'a.', 'Pertaining to, resembling, or characteristic of, the\n   stag, or Cervus elaphus.'),
(24220, 'Elaphure', 'n.', 'A species of deer (Elaphurus Davidianus) found in china.\n   It is about four feet high at the shoulder and has peculiar antlers.'),
(24221, 'Elapine', 'a.', 'Like or pertaining to the Elapidae, a family of poisonous\n   serpents, including the cobras. See Ophidia.'),
(24222, 'Elaps', 'n.', 'A genus of venomous snakes found both in America and the Old\n   World. Many species are known. See Coral snake, under Coral.'),
(24223, 'Elapsed', 'imp. & p. p.', 'of Elapse'),
(24224, 'Elapsing', 'p. pr. & vb. n.', 'of Elapse'),
(24225, 'Elapse', 'v. i.', 'To slip or glide away; to pass away silently, as time;\n   -- used chiefly in reference to time.'),
(24226, 'Elapsion', 'n.', 'The act of elapsing.'),
(24227, 'Elastic', 'a.', 'Springing back; having a power or inherent property of\n   returning to the form from which a substance is bent, drawn, pressed,\n   or twisted; springy; having the power of rebounding; as, a bow is\n   elastic; the air is elastic; India rubber is elastic.'),
(24228, 'Elastic', 'a.', 'Able to return quickly to a former state or condition,\n   after being depressed or overtaxed; having power to recover easily from\n   shocks and trials; as, elastic spirits; an elastic constitution.'),
(24229, 'Elastic', 'n.', 'An elastic woven fabric, as a belt, braces or suspenders,\n   etc., made in part of India rubber.'),
(24230, 'Elastin', 'n.', 'A nitrogenous substance, somewhat resembling albumin,\n   which forms the chemical basis of elastic tissue. It is very insoluble\n   in most fluids, but is gradually dissolved when digested with either\n   pepsin or trypsin.'),
(24231, 'Elate', 'a.', 'Lifted up; raised; elevated.'),
(24232, 'Elate', 'a.', 'Having the spirits raised by success, or by hope; flushed or\n   exalted with confidence; elated; exultant.'),
(24233, 'Elated', 'imp. & p. p.', 'of Elate'),
(24234, 'Elating', 'p. pr. & vb. n.', 'of Elate'),
(24235, 'Elate', 'v. t.', 'To raise; to exalt.'),
(24236, 'Elate', 'v. t.', 'To exalt the spirit of; to fill with confidence or\n   exultation; to elevate or flush with success; to puff up; to make\n   proud.'),
(24237, 'Elatedly', 'adv.', 'With elation.'),
(24238, 'Elater', 'n.', 'One who, or that which, elates.'),
(24239, 'Elater', 'n.', 'An elastic spiral filament for dispersing the spores, as in\n   some liverworts.'),
(24240, 'Elater', 'n.', 'Any beetle of the family Elateridae, having the habit, when\n   laid on the back, of giving a sudden upward spring, by a quick movement\n   of the articulation between the abdomen and thorax; -- called also\n   click beetle, spring beetle, and snapping beetle.'),
(24241, 'Elater', 'n.', 'The caudal spring used by Podura and related insects for\n   leaping. See Collembola.'),
(24242, 'Elater', 'n.', 'The active principle of elaterium, being found in the juice\n   of the wild or squirting cucumber (Ecballium agreste, formerly\n   Motordica Elaterium) and other related species. It is extracted as a\n   bitter, white, crystalline substance, which is a violent purgative.'),
(24243, 'Elatery', 'n.', 'Acting force; elasticity.'),
(24244, 'Elation', 'n.', 'A lifting up by success; exaltation; inriation with pride\n   of prosperity.'),
(24245, 'Elative', 'a.', 'Raised; lifted up; -- a term applied to what is also\n   called the absolute superlative, denoting a high or intense degree of a\n   quality, but not excluding the idea that an equal degree may exist in\n   other cases.'),
(24246, 'Elayl', 'n.', 'Olefiant gas or ethylene; -- so called by Berzelius from its\n   forming an oil combining with chlorine. [Written also elayle.] See\n   Ethylene.'),
(24247, 'Elbow', 'n.', 'The joint or bend of the arm; the outer curve in the middle\n   of the arm when bent.'),
(24248, 'Elbow', 'n.', 'Any turn or bend like that of the elbow, in a wall,\n   building, and the like; a sudden turn in a line of coast or course of a\n   river; also, an angular or jointed part of any structure, as the raised\n   arm of a chair or sofa, or a short pipe fitting, turning at an angle or\n   bent.'),
(24249, 'Elbow', 'n.', 'A sharp angle in any surface of wainscoting or other\n   woodwork; the upright sides which flank any paneled work, as the sides\n   of windows, where the jamb makes an elbow with the window back.'),
(24250, 'Elbowed', 'imp. & p. p.', 'of Elbow'),
(24251, 'Elbowing', 'p. pr. & vb. n.', 'of Elbow'),
(24252, 'Elbow', 'v. t.', 'To push or hit with the elbow, as when one pushes by\n   another.'),
(24253, 'Elbow', 'v. i.', 'To jut into an angle; to project or to bend after the\n   manner of an elbow.'),
(24254, 'Elbow', 'v. i.', 'To push rudely along; to elbow one\'s way.'),
(24255, 'Elcaja', 'n.', 'An Arabian tree (Trichilia emetica). The fruit, which is\n   emetic, is sometimes employed in the composition of an ointment for the\n   cure of the itch.'),
(24256, 'Elder', 'a.', 'Older; more aged, or existing longer.'),
(24257, 'Elder', 'a.', 'Born before another; prior in years; senior; earlier; older;\n   as, his elder brother died in infancy; -- opposed to younger, and now\n   commonly applied to a son, daughter, child, brother, etc.'),
(24258, 'Elder', 'a.', 'One who is older; a superior in age; a senior.'),
(24259, 'Elder', 'a.', 'An aged person; one who lived at an earlier period; a\n   predecessor.'),
(24260, 'Elder', 'a.', 'A person who, on account of his age, occupies the office of\n   ruler or judge; hence, a person occupying any office appropriate to\n   such as have the experience and dignity which age confers; as, the\n   elders of Israel; the elders of the synagogue; the elders in the\n   apostolic church.'),
(24261, 'Elder', 'a.', 'A clergyman authorized to administer all the sacraments; as,\n   a traveling elder.'),
(24262, 'Elder', 'n.', 'A genus of shrubs (Sambucus) having broad umbels of white\n   flowers, and small black or red berries.'),
(24263, 'Elderish', 'a.', 'Somewhat old; elderly.'),
(24264, 'Elderly', 'a.', 'Somewhat old; advanced beyond middle age; bordering on old\n   age; as, elderly people.'),
(24265, 'Eldern', 'a.', 'Made of elder.'),
(24266, 'Eldest', 'a.', 'Oldest; longest in duration.'),
(24267, 'Eldest', 'a.', 'Born or living first, or before the others, as a son,\n   daughter, brother, etc.; first in origin. See Elder.'),
(24268, 'Elding', 'n.', 'Fuel.'),
(24269, 'Eldritch', 'a.', 'Hideous; ghastly; as, an eldritch shriek or laugh.'),
(24270, 'Eleatic', 'a.', 'Of or pertaining to a certain school of Greek philosophers\n   who taught that the only certain science is that which owes nothing to\n   the senses, and all to the reason.'),
(24271, 'Eleatic', 'n.', 'A philosopher of the Eleatic school.'),
(24272, 'Elect', 'a.', 'Chosen; taken by preference from among two or more.'),
(24273, 'Elect', 'a.', 'Chosen as the object of mercy or divine favor; set apart to\n   eternal life.'),
(24274, 'Elect', 'a.', 'Chosen to an office, but not yet actually inducted into it;\n   as, bishop elect; governor or mayor elect.'),
(24275, 'Elect', 'n.', 'One chosen or set apart.'),
(24276, 'Elect', 'n.', 'Those who are chosen for salvation.'),
(24277, 'Elected', 'imp. & p. p.', 'of Elect'),
(24278, 'Electing', 'p. pr. & vb. n.', 'of Elect'),
(24279, 'Elect', 'v. t.', 'To pick out; to select; to choose.'),
(24280, 'Elect', 'v. t.', 'To select or take for an office; to select by vote; as,\n   to elect a representative, a president, or a governor.'),
(24281, 'Elect', 'v. t.', 'To designate, choose, or select, as an object of mercy or\n   favor.'),
(24282, 'Electant', 'n.', 'One who has the power of choosing; an elector.'),
(24283, 'Electary', 'n.', 'See Electuary.'),
(24284, 'Electic', 'a.', 'See Eclectic.'),
(24285, 'Election', 'a.', 'The act of choosing; choice; selection.'),
(24286, 'Election', 'a.', 'The act of choosing a person to fill an office, or to\n   membership in a society, as by ballot, uplifted hands, or viva voce;\n   as, the election of a president or a mayor.'),
(24287, 'Election', 'a.', 'Power of choosing; free will; liberty to choose or act.'),
(24288, 'Election', 'a.', 'Discriminating choice; discernment.'),
(24289, 'Election', 'a.', 'Divine choice; predestination of individuals as objects\n   of mercy and salvation; -- one of the \"five points\" of Calvinism.'),
(24290, 'Election', 'a.', 'The choice, made by a party, of two alternatives, by\n   taking one of which, the chooser is excluded from the other.'),
(24291, 'Election', 'a.', 'Those who are elected.'),
(24292, 'Elective', 'a.', 'Exerting the power of choice; selecting; as, an elective\n   act.'),
(24293, 'Elective', 'a.', 'Pertaining to, or consisting in, choice, or right of\n   choosing; electoral.'),
(24294, 'Elective', 'a.', 'Dependent on choice; bestowed or passing by election; as,\n   an elective study; an elective office.'),
(24295, 'Elective', 'n.', 'In an American college, an optional study or course of\n   study.'),
(24296, 'Elector', 'n.', 'One who elects, or has the right of choice; a person who\n   is entitled to take part in an election, or to give his vote in favor\n   of a candidate for office.'),
(24297, 'Elector', 'n.', 'Hence, specifically, in any country, a person legally\n   qualified to vote.'),
(24298, 'Elector', 'n.', 'In the old German empire, one of the princes entitled to\n   choose the emperor.'),
(24299, 'Elector', 'n.', 'One of the persons chosen, by vote of the people in the\n   United States, to elect the President and Vice President.'),
(24300, 'Elector', 'a.', 'Pertaining to an election or to electors.'),
(24301, 'Electre', 'n.', 'Alt. of Electer'),
(24302, 'Electer', 'n.', 'Amber. See Electrum.'),
(24303, 'Electer', 'n.', 'A metallic substance compounded of gold and silver; an\n   alloy.'),
(24304, 'Electric', 'a.', 'Alt. of Electrical'),
(24305, 'Electric', 'n.', 'A nonconductor of electricity, as amber, glass, resin,\n   etc., employed to excite or accumulate electricity.'),
(24306, 'Electro-', '', 'A prefix or combining form signifying pertaining to\n   electricity, produced by electricity, producing or employing\n   electricity, etc.; as, electro-negative; electro-dynamic;\n   electro-magnet.'),
(24307, 'Electro', 'n.', 'An electrotype.'),
(24308, 'Electron', 'n.', 'Amber; also, the alloy of gold and silver, called\n   electrum.'),
(24309, 'Electrum', 'n.', 'Amber.'),
(24310, 'Electrum', 'n.', 'An alloy of gold and silver, of an amber color, used by\n   the ancients.'),
(24311, 'Electrum', 'n.', 'German-silver plate. See German silver, under German.'),
(24312, 'Elegance', 'n.', 'Alt. of Elegancy'),
(24313, 'Elegancy', 'n.', 'The state or quality of being elegant; beauty as\n   resulting from choice qualities and the complete absence of what\n   deforms or impresses unpleasantly; grace given by art or practice; fine\n   polish; refinement; -- said of manners, language, style, form,\n   architecture, etc.'),
(24314, 'Elegancy', 'n.', 'That which is elegant; that which is tasteful and highly\n   attractive.'),
(24315, 'Elegant', 'a.', 'Very choice, and hence, pleasing to good taste;\n   characterized by grace, propriety, and refinement, and the absence of\n   every thing offensive; exciting admiration and approbation by symmetry,\n   completeness, freedom from blemish, and the like; graceful; tasteful\n   and highly attractive; as, elegant manners; elegant style of\n   composition; an elegant speaker; an elegant structure.'),
(24316, 'Elegant', 'a.', 'Exercising a nice choice; discriminating beauty or\n   sensitive to beauty; as, elegant taste.'),
(24317, 'Elegiac', 'a.', 'Belonging to elegy, or written in elegiacs; plaintive;\n   expressing sorrow or lamentation; as, an elegiac lay; elegiac strains.'),
(24318, 'Elegiac', 'a.', 'Used in elegies; as, elegiac verse; the elegiac distich or\n   couplet, consisting of a dactylic hexameter and pentameter.'),
(24319, 'Elegiac', 'n.', 'Elegiac verse.'),
(24320, 'Elegiast', 'n.', 'One who composes elegies.'),
(24321, 'Elegist', 'n.', 'A write of elegies.'),
(24322, 'Elegit', 'n.', 'A judicial writ of execution, by which a defendant\'s goods\n   are appraised and delivered to the plaintiff, and, if not sufficient to\n   satisfy the debt, all of his lands are delivered, to be held till the\n   debt is paid by the rents and profits, or until the defendant\'s\n   interest has expired.'),
(24323, 'Elegize', 'v. t.', 'To lament in an elegy; to celebrate in elegiac verse;\n   to bewail.'),
(24324, 'Elegies', 'pl. ', 'of Elegy'),
(24325, 'Elegy', 'n.', 'A mournful or plaintive poem; a funereal song; a poem of\n   lamentation.'),
(24326, 'Eleidin', 'n.', 'Lifeless matter deposited in the form of minute granules\n   within the protoplasm of living cells.'),
(24327, 'Element', 'n.', 'One of the simplest or essential parts or principles of\n   which anything consists, or upon which the constitution or fundamental\n   powers of anything are based.'),
(24328, 'Element', 'n.', 'One of the ultimate, undecomposable constituents of any\n   kind of matter. Specifically: (Chem.) A substance which cannot be\n   decomposed into different kinds of matter by any means at present\n   employed; as, the elements of water are oxygen and hydrogen.'),
(24329, 'Element', 'n.', 'One of the ultimate parts which are variously combined in\n   anything; as, letters are the elements of written language; hence,\n   also, a simple portion of that which is complex, as a shaft, lever,\n   wheel, or any simple part in a machine; one of the essential\n   ingredients of any mixture; a constituent part; as, quartz, feldspar,\n   and mica are the elements of granite.'),
(24330, 'Element', 'n.', 'One out of several parts combined in a system of\n   aggregation, when each is of the nature of the whole; as, a single cell\n   is an element of the honeycomb.'),
(24331, 'Element', 'n.', 'One of the smallest natural divisions of the organism, as\n   a blood corpuscle, a muscular fiber.'),
(24332, 'Element', 'n.', 'One of the simplest essential parts, more commonly called\n   cells, of which animal and vegetable organisms, or their tissues and\n   organs, are composed.'),
(24333, 'Element', 'n.', 'An infinitesimal part of anything of the same nature as\n   the entire magnitude considered; as, in a solid an element may be the\n   infinitesimal portion between any two planes that are separated an\n   indefinitely small distance. In the calculus, element is sometimes used\n   as synonymous with differential.'),
(24334, 'Element', 'n.', 'Sometimes a curve, or surface, or volume is considered as\n   described by a moving point, or curve, or surface, the latter being at\n   any instant called an element of the former.'),
(24335, 'Element', 'n.', 'One of the terms in an algebraic expression.'),
(24336, 'Element', 'n.', 'One of the necessary data or values upon which a system of\n   calculations depends, or general conclusions are based; as, the\n   elements of a planet\'s orbit.'),
(24337, 'Element', 'n.', 'The simplest or fundamental principles of any system in\n   philosophy, science, or art; rudiments; as, the elements of geometry,\n   or of music.'),
(24338, 'Element', 'n.', 'Any outline or sketch, regarded as containing the\n   fundamental ideas or features of the thing in question; as, the\n   elements of a plan.'),
(24339, 'Element', 'n.', 'One of the simple substances, as supposed by the ancient\n   philosophers; one of the imaginary principles of matter.'),
(24340, 'Element', 'n.', 'The four elements were, air, earth, water, and fire'),
(24341, 'Element', 'n.', 'the conditions and movements of the air.'),
(24342, 'Element', 'n.', 'The elements of the alchemists were salt, sulphur, and\n   mercury.'),
(24343, 'Element', 'n.', 'The whole material composing the world.'),
(24344, 'Element', 'n.', 'The bread and wine used in the eucharist or Lord\'s supper.'),
(24345, 'Element', 'v. t.', 'To compound of elements or first principles.'),
(24346, 'Element', 'v. t.', 'To constitute; to make up with elements.'),
(24347, 'Elemi', 'n.', 'A fragrant gum resin obtained chiefly from tropical trees of\n   the genera Amyris and Canarium. A. elemifera yields Mexican elemi; C.\n   commune, the Manila elemi. It is used in the manufacture of varnishes,\n   also in ointments and plasters.'),
(24348, 'Elemin', 'n.', 'A transparent, colorless oil obtained from elemi resin by\n   distillation with water; also, a crystallizable extract from the resin.'),
(24349, 'Elenchs', 'pl. ', 'of Elench'),
(24350, 'Elench', 'n.', 'That part of an argument on which its conclusiveness\n   depends; that which convinces of refutes an antagonist; a refutation.'),
(24351, 'Elench', 'n.', 'A specious but fallacious argument; a sophism.'),
(24352, 'Elenchus', 'n.', 'Same as Elench.'),
(24353, 'Elenctic', 'a.', 'Alt. of Elenctical'),
(24354, 'Elenge', 'a.', 'Sorrowful; wretched; full of trouble.'),
(24355, 'Elephant', 'n.', 'A mammal of the order Proboscidia, of which two living\n   species, Elephas Indicus and E. Africanus, and several fossil species,\n   are known. They have a proboscis or trunk, and two large ivory tusks\n   proceeding from the extremity of the upper jaw, and curving upwards.\n   The molar teeth are large and have transverse folds. Elephants are the\n   largest land animals now existing.'),
(24356, 'Elephant', 'n.', 'Ivory; the tusk of the elephant.'),
(24357, 'Elevate', 'a.', 'Elevated; raised aloft.'),
(24358, 'Elevated', 'imp. & p. p.', 'of Elevate'),
(24359, 'Elevate', 'v. t.', 'To bring from a lower place to a higher; to lift up; to\n   raise; as, to elevate a weight, a flagstaff, etc.'),
(24360, 'Elevate', 'v. t.', 'To raise to a higher station; to promote; as, to\n   elevate to an office, or to a high social position.'),
(24361, 'Elevate', 'v. t.', 'To raise from a depressed state; to animate; to cheer;\n   as, to elevate the spirits.'),
(24362, 'Elevate', 'v. t.', 'To exalt; to ennoble; to dignify; as, to elevate the\n   mind or character.'),
(24363, 'Elevate', 'v. t.', 'To raise to a higher pitch, or to a greater degree of\n   loudness; -- said of sounds; as, to elevate the voice.'),
(24364, 'Elevate', 'v. t.', 'To intoxicate in a slight degree; to render tipsy.'),
(24365, 'Elevate', 'v. t.', 'To lessen; to detract from; to disparage.'),
(24366, 'Elevated', 'a.', 'Uplifted; high; lofty; also, animated; noble; as,\n   elevated thoughts.'),
(24367, 'Elevator', 'n.', 'One who, or that which, raises or lifts up anything'),
(24368, 'Elevator', 'n.', 'A mechanical contrivance, usually an endless belt or\n   chain with a series of scoops or buckets, for transferring grain to an\n   upper loft for storage.'),
(24369, 'Elevator', 'n.', 'A cage or platform and the hoisting machinery in a hotel,\n   warehouse, mine, etc., for conveying persons, goods, etc., to or from\n   different floors or levels; -- called in England a lift; the cage or\n   platform itself.'),
(24370, 'Elevator', 'n.', 'A building for elevating, storing, and discharging,\n   grain.'),
(24371, 'Elevator', 'n.', 'A muscle which serves to raise a part of the body, as the\n   leg or the eye.'),
(24372, 'Elevator', 'n.', 'An instrument for raising a depressed portion of a bone.'),
(24373, 'Eleve', 'n.', 'A pupil; a student.'),
(24374, 'Eleven', 'a.', 'Ten and one added; as, eleven men.'),
(24375, 'Eleven', 'n.', 'The sum of ten and one; eleven units or objects.'),
(24376, 'Eleven', 'n.', 'A symbol representing eleven units, as 11 or xi.'),
(24377, 'Eleven', 'n.', 'The eleven men selected to play on one side in a match, as\n   the representatives of a club or a locality; as, the all-England\n   eleven.'),
(24378, 'Eleventh', 'a.', 'Next after the tenth; as, the eleventh chapter.'),
(24379, 'Eleventh', 'a.', 'Constituting one of eleven parts into which a thing is\n   divided; as, the eleventh part of a thing.'),
(24380, 'Eleventh', 'a.', 'Of or pertaining to the interval of the octave and the\n   fourth.'),
(24381, 'Eleventh', 'n.', 'The quotient of a unit divided by eleven; one of eleven\n   equal parts.'),
(24382, 'Eleventh', 'n.', 'The interval consisting of ten conjunct degrees; the\n   interval made up of an octave and a fourth.'),
(24383, 'Elves', 'pl. ', 'of Elf'),
(24384, 'Elfin', 'a.', 'Relating to elves.'),
(24385, 'Elfin', 'n.', 'A little elf or urchin.'),
(24386, 'Elfish', 'a.', 'Of or relating to the elves; elflike; implike; weird;\n   scarcely human; mischievous, as though caused by elves.'),
(24387, 'Elfishly', 'adv.', 'In an elfish manner.'),
(24388, 'Elfkin', 'n.', 'A little elf.'),
(24389, 'Elfland', 'n.', 'Fairyland.'),
(24390, 'Elflock', 'n.', 'Hair matted, or twisted into a knot, as if by elves.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(24391, 'Elicit', 'a.', 'Elicited; drawn out; made real; open; evident.'),
(24392, 'Elicited', 'imp. & p. p.', 'of Elicit'),
(24393, 'Elicit', 'v. t.', 'To draw out or entice forth; to bring to light; to bring\n   out against the will; to deduce by reason or argument; as, to elicit\n   truth by discussion.'),
(24394, 'Elided', 'imp. & p. p.', 'of Elide'),
(24395, 'Eliding', 'p. pr. & vb. n.', 'of Elide'),
(24396, 'Elide', 'v. t.', 'To break or dash in pieces; to demolish; as, to elide the\n   force of an argument.'),
(24397, 'Elide', 'v. t.', 'To cut off, as a vowel or a syllable, usually the final\n   one; to subject to elision.'),
(24398, 'Eligible', 'a.', 'That may be selected; proper or qualified to be chosen;\n   legally qualified to be elected and to hold office.'),
(24399, 'Eligible', 'a.', 'Worthy to be chosen or selected; suitable; desirable; as,\n   an eligible situation for a house.'),
(24400, 'Eligibly', 'adv.', 'In an eligible manner.'),
(24401, 'Elimate', 'v. t.', 'To render smooth; to polish.'),
(24402, 'Elinguid', 'a.', 'Tongue-tied; dumb.'),
(24403, 'Elison', 'n.', 'Division; separation.'),
(24404, 'Elison', 'n.', 'The cutting off or suppression of a vowel or syllable, for\n   the sake of meter or euphony; esp., in poetry, the dropping of a final\n   vowel standing before an initial vowel in the following word, when the\n   two words are drawn together.'),
(24405, 'Elisor', 'n.', 'An elector or chooser; one of two persons appointed by a\n   court to return a jury or serve a writ when the sheriff and the\n   coroners are disqualified.'),
(24406, 'Elite', 'n.', 'A choice or select body; the flower; as, the elite of\n   society.'),
(24407, 'Elixate', 'v. t.', 'To boil; to seethe; hence, to extract by boiling or\n   seething.'),
(24408, 'Elixir', 'n.', 'A tincture with more than one base; a compound tincture or\n   medicine, composed of various substances, held in solution by alcohol\n   in some form.'),
(24409, 'Elixir', 'n.', 'An imaginary liquor capable of transmuting metals into\n   gold; also, one for producing life indefinitely; as, elixir vitae, or\n   the elixir of life.'),
(24410, 'Elixir', 'n.', 'The refined spirit; the quintessence.'),
(24411, 'Elixir', 'n.', 'Any cordial or substance which invigorates.'),
(24412, 'Elknut', 'n.', 'The buffalo nut. See under Buffalo.'),
(24413, 'Elkwood', 'n.', 'The soft, spongy wood of a species of Magnolia (M.\n   Umbrella).'),
(24414, 'Ellagic', 'a.', 'Pertaining to, or derived from, gallnuts or gallic acid;\n   as, ellagic acid.'),
(24415, 'Ellebore', 'n.', 'Hellebore.'),
(24416, 'Elleck', 'n.', 'The red gurnard or cuckoo fish.'),
(24417, 'Ellenge', 'n', 'Alt. of Ellingeness'),
(24418, 'Ellinge', 'n', 'Alt. of Ellingeness'),
(24419, 'Elles', 'adv. & conj.', 'See Else.'),
(24420, 'Ellipse', 'n.', 'An oval or oblong figure, bounded by a regular curve,\n   which corresponds to an oblique projection of a circle, or an oblique\n   section of a cone through its opposite sides. The greatest diameter of\n   the ellipse is the major axis, and the least diameter is the minor\n   axis. See Conic section, under Conic, and cf. Focus.'),
(24421, 'Ellipse', 'n.', 'Omission. See Ellipsis.'),
(24422, 'Ellipse', 'n.', 'The elliptical orbit of a planet.'),
(24423, 'Ellipses', 'pl. ', 'of Ellipsis'),
(24424, 'Ellipsis', 'n.', 'Omission; a figure of syntax, by which one or more words,\n   which are obviously understood, are omitted; as, the virtues I admire,\n   for, the virtues which I admire.'),
(24425, 'Ellipsis', 'n.', 'An ellipse.'),
(24426, 'Elliptic', 'a.', 'Alt. of Elliptical'),
(24427, 'Ellwand', 'n.', 'Formerly, a measuring rod an ell long.'),
(24428, 'Elmen', 'a.', 'Belonging to elms.'),
(24429, 'Elocular', 'a.', 'Having but one cell, or cavity; not divided by a septum\n   or partition.'),
(24430, 'Elodian', 'n.', 'One of a tribe of tortoises, including the terrapins,\n   etc., in which the head and neck can be withdrawn.'),
(24431, 'Eloge', 'n.', 'A panegyrical funeral oration.'),
(24432, 'Elogist', 'n.', 'One who pronounces an eloge.'),
(24433, 'Elogium', 'n.', 'Alt. of Elogy'),
(24434, 'Elogy', 'n.', 'The praise bestowed on a person or thing; panegyric; eulogy.'),
(24435, 'Elohim', 'n.', 'One of the principal names by which God is designated in\n   the Hebrew Scriptures.'),
(24436, 'Elohist', 'n.', 'The writer, or one of the writers, of the passages of the\n   Old Testament, notably those of Elohim instead of Jehovah, as the name\n   of the Supreme Being; -- distinguished from Jehovist.'),
(24437, 'Eloigned', 'imp. & p. p.', 'of Eloign'),
(24438, 'Eloign', 'v. t.', 'To remove afar off; to withdraw.'),
(24439, 'Eloign', 'v. t.', 'To convey to a distance, or beyond the jurisdiction, or\n   to conceal, as goods liable to distress.'),
(24440, 'Eloin', 'v. t.', 'See Eloign.'),
(24441, 'Eloinate', 'v. t.', 'See Eloignate.'),
(24442, 'Elong', 'v. t.', 'To lengthen out; to prolong.'),
(24443, 'Elong', 'v. t.', 'To put away; to separate; to keep off.'),
(24444, 'Elongate', 'a.', 'To lengthen; to extend; to stretch; as, to elongate a\n   line.'),
(24445, 'Elongate', 'a.', 'To remove further off.'),
(24446, 'Elongate', 'v. i.', 'To depart to, or be at, a distance; esp., to recede\n   apparently from the sun, as a planet in its orbit.'),
(24447, 'Elongate', 'a.', 'Drawn out at length; elongated; as, an elongate leaf.'),
