(24688, 'Emeer', 'n.', 'An Arabian military commander, independent chieftain, or\n   ruler of a province; also, an honorary title given to the descendants\n   of Mohammed, in the line of his daughter Fatima; among the Turks,\n   likewise, a title of dignity, given to certain high officials.'),
(24689, 'Emirship', 'n.', 'Alt. of Emeership'),
(24690, 'Emissary', 'n.', 'An agent employed to advance, in a covert manner, the\n   interests of his employers; one sent out by any power that is at war\n   with another, to create dissatisfaction among the people of the latter.'),
(24691, 'Emissary', 'a.', 'Exploring; spying.'),
(24692, 'Emissary', 'a.', 'Applied to the veins which pass out of the cranium\n   through apertures in its walls.'),
(24693, 'Emission', 'n.', 'The act of sending or throwing out; the act of sending\n   forth or putting into circulation; issue; as, the emission of light\n   from the sun; the emission of heat from a fire; the emission of bank\n   notes.'),
(24694, 'Emission', 'n.', 'That which is sent out, issued, or put in circulation at\n   one time; issue; as, the emission was mostly blood.'),
(24695, 'Emissive', 'a.', 'Sending out; emitting; as, emissive powers.'),
