(24698, 'Emitting', 'p. pr. & vb. n.', 'of Emit'),
(24699, 'Emittent', 'a.', 'Sending forth; emissive.'),
(24700, 'Emmantle', 'v. t.', 'To cover over with, or as with, a mantle; to put about\n   as a protection.'),
(24701, 'Emmanuel', 'n.', 'See Immanuel.'),
(24702, 'Emmarble', 'v. t.', 'To turn to marble; to harden.'),
(24703, 'Emmet', 'n.', 'An ant.'),
(24704, 'Emmew', 'v. t.', 'To mew or coop up.'),
(24705, 'Emmove', 'v. t.', 'To move; to rouse; to excite.'),
(24706, 'Emodin', 'n.', 'An orange-red crystalline substance, C15H10O5, obtained\n   from the buckthorn, rhubarb, etc., and regarded as a derivative of\n   anthraquinone; -- so called from a species of rhubarb (Rheum emodei).'),
(24707, 'Emong', 'prep.', 'Alt. of Emongst'),
(24708, 'Emongst', 'prep.', 'Among.'),
(24709, 'Emotion', 'n.', 'A moving of the mind or soul; excitement of the feelings,\n   whether pleasing or painful; disturbance or agitation of mind caused by\n   a specific exciting cause and manifested by some sensible effect on the\n   body.'),
