(24731, 'Emperor', 'n.', 'The sovereign or supreme monarch of an empire; -- a title\n   of dignity superior to that of king; as, the emperor of Germany or of\n   Austria; the emperor or Czar of Russia.'),
(24732, 'Empery', 'n.', 'Empire; sovereignty; dominion.'),
(24733, 'Emphases', 'pl. ', 'of Emphasis'),
(24734, 'Emphasis', 'n.', 'A particular stress of utterance, or force of voice,\n   given in reading and speaking to one or more words whose signification\n   the speaker intends to impress specially upon his audience.'),
(24735, 'Emphasis', 'n.', 'A peculiar impressiveness of expression or weight of\n   thought; vivid representation, enforcing assent; as, to dwell on a\n   subject with great emphasis.'),
(24736, 'Emphatic', 'a.', 'Alt. of Emphatical'),
(24737, 'Empierce', 'v. t.', 'To pierce; to impierce.'),
(24738, 'Empight', 'a.', 'Fixed; settled; fastened.'),
(24739, 'Empire', 'n.', 'Supreme power; sovereignty; sway; dominion.'),
(24740, 'Empire', 'n.', 'The dominion of an emperor; the territory or countries\n   under the jurisdiction and dominion of an emperor (rarely of a king),\n   usually of greater extent than a kingdom, always comprising a variety\n   in the nationality of, or the forms of administration in, constituent\n   and subordinate portions; as, the Austrian empire.'),
(24741, 'Empire', 'n.', 'Any dominion; supreme control; governing influence; rule;\n   sway; as, the empire of mind or of reason.'),
(24742, 'Empiric', 'n.', 'One who follows an empirical method; one who relies upon\n   practical experience.'),
(24743, 'Empiric', 'n.', 'One who confines himself to applying the results of mere\n   experience or his own observation; especially, in medicine, one who\n   deviates from the rules of science and regular practice; an ignorant\n   and unlicensed pretender; a quack; a charlatan.'),
(24744, 'Empiric', 'a.', 'Alt. of Empirical'),
(24745, 'Emplead', 'v. t.', 'To accuse; to indict. See Implead.'),
(24746, 'Emplore', 'v. t.', 'See Implore.'),
(24747, 'Employed', 'imp. & p. p.', 'of Employ'),
(24748, 'Employ', 'v. t.', 'To inclose; to infold.'),
(24749, 'Employ', 'v. t.', 'To use; to have in service; to cause to be engaged in\n   doing something; -- often followed by in, about, on, or upon, and\n   sometimes by to; as: (a) To make use of, as an instrument, a means, a\n   material, etc., for a specific purpose; to apply; as, to employ the pen\n   in writing, bricks in building, words and phrases in speaking; to\n   employ the mind; to employ one\'s energies.'),
(24750, 'Employ', 'v. t.', 'To occupy; as, to employ time in study.'),
(24751, 'Employ', 'v. t.', 'To have or keep at work; to give employment or\n   occupation to; to intrust with some duty or behest; as, to employ a\n   hundred workmen; to employ an envoy.'),
(24752, 'Employ', 'n.', 'That which engages or occupies a person; fixed or regular\n   service or business; employment.'),
(24753, 'Employe', 'n.', 'One employed by another; a clerk or workman in the service\n   of an employer.'),
(24754, 'Employee', 'n.', 'One employed by another.'),
(24755, 'Employer', 'n.', 'One who employs another; as, an employer of workmen.'),
(24756, 'Emplumed', 'a.', 'Plumed.'),
(24757, 'Emplunge', 'v. t.', 'To plunge; to implunge.'),
(24758, 'Empoison', 'v. t.', 'To poison; to impoison.'),
(24759, 'Empoison', 'n.', 'Poison.'),
(24760, 'Emporia', 'pl. ', 'of Emporium'),
(24761, 'Emporium', 'n.', 'A place of trade; a market place; a mart; esp., a city or\n   town with extensive commerce; the commercial center of a country.'),
(24762, 'Emporium', 'n.', 'The brain.'),
(24763, 'Empower', 'v. t.', 'To give authority to; to delegate power to; to\n   commission; to authorize (having commonly a legal force); as, the\n   Supreme Court is empowered to try and decide cases, civil or criminal;\n   the attorney is empowered to sign an acquittance, and discharge the\n   debtor.'),
(24764, 'Empower', 'v. t.', 'To give moral or physical power, faculties, or\n   abilities to.'),
(24765, 'Empress', 'n.', 'The consort of an emperor.'),
