(24767, 'Empress', 'n.', 'A sovereign mistress.'),
(24768, 'Emprint', 'v. t.', 'See Imprint.'),
(24769, 'Emprise', 'n.', 'An enterprise; endeavor; adventure.'),
(24770, 'Emprise', 'n.', 'The qualifies which prompt one to undertake difficult and\n   dangerous exploits.'),
(24771, 'Emprise', 'v. t.', 'To undertake.'),
(24772, 'Emprison', 'v. t.', 'See Imprison.'),
(24773, 'Empte', 'v. t.', 'To empty.'),
(24774, 'Emptier', 'n.', 'One who, or that which, empties.'),
(24775, 'Emptier', 'compar.', 'of Empty.'),
(24776, 'Emption', 'n.', 'The act of buying.'),
(24777, 'Empty', 'superl.', 'Containing nothing; not holding or having anything\n   within; void of contents or appropriate contents; not filled; -- said\n   of an inclosure, as a box, room, house, etc.; as, an empty chest, room,\n   purse, or pitcher; an empty stomach; empty shackles.'),
(24778, 'Empty', 'superl.', 'Free; clear; devoid; -- often with of.'),
(24779, 'Empty', 'superl.', 'Having nothing to carry; unburdened.'),
(24780, 'Empty', 'superl.', 'Destitute of effect, sincerity, or sense; -- said of\n   language; as, empty words, or threats.'),
(24781, 'Empty', 'superl.', 'Unable to satisfy; unsatisfactory; hollow; vain; --\n   said of pleasure, the world, etc.'),
(24782, 'Empty', 'superl.', 'Producing nothing; unfruitful; -- said of a plant or\n   tree; as, an empty vine.'),
(24783, 'Empty', 'superl.', 'Destitute of, or lacking, sense, knowledge, or\n   courtesy; as, empty brains; an empty coxcomb.'),
(24784, 'Empty', 'superl.', 'Destitute of reality, or real existence; unsubstantial;\n   as, empty dreams.'),
(24785, 'Empties', 'pl. ', 'of Empty'),
(24786, 'Empty', 'n.', 'An empty box, crate, cask, etc.; -- used in commerce, esp.\n   in transportation of freight; as, \"special rates for empties.\"'),
