(24807, 'Emulated', 'imp. & p. p.', 'of Emulate'),
(24808, 'Emulate', 'v. t.', 'To strive to equal or to excel in qualities or actions;\n   to imitate, with a view to equal or to outdo, to vie with; to rival;\n   as, to emulate the good and the great.'),
