(24815, 'Emulous', 'a.', 'Ambitiously desirous to equal or even to excel another;\n   eager to emulate or vie with another; desirous of like excellence with\n   another; -- with of; as, emulous of another\'s example or virtues.'),
(24816, 'Emulous', 'a.', 'Vying with; rivaling; hence, contentious, envious.'),
(24817, 'Emulsic', 'a.', 'Pertaining to, or produced from, emulsin; as, emulsic\n   acid.'),
(24818, 'Emulsify', 'v. t.', 'To convert into an emulsion; to form an emulsion; to\n   reduce from an oily substance to a milky fluid in which the fat\n   globules are in a very finely divided state, giving it the semblance of\n   solution; as, the pancreatic juice emulsifies the oily part of food.'),
(24819, 'Emulsin', 'n.', 'The white milky pulp or extract of bitter almonds.'),
(24820, 'Emulsin', 'n.', 'An unorganized ferment (contained in this extract and in\n   other vegetable juices), which effects the decomposition of certain\n   glucosides.'),
(24821, 'Emulsion', 'n.', 'Any liquid preparation of a color and consistency\n   resembling milk; as: (a) In pharmacy, an extract of seeds, or a mixture\n   of oil and water united by a mucilaginous substance. (b) In\n   photography, a liquid preparation of collodion holding salt of silver,\n   used in the photographic process.'),
(24822, 'Emulsive', 'a.', 'Softening; milklike.'),
(24823, 'Emulsive', 'a.', 'Yielding oil by expression; as, emulsive seeds.'),
(24824, 'Emulsive', 'a.', 'Producing or yielding a milklike substance; as, emulsive\n   acids.'),
(24825, 'Emu wren', '', 'A small wrenlike Australian bird (Stipiturus malachurus),\n   having the tail feathers long and loosely barbed, like emu feathers.'),
