(24900, 'Enchase', 'v. t.', 'To delineate or describe, as by writing.'),
(24901, 'Enchaser', 'n.', 'One who enchases.'),
(24902, 'Encheson', 'n.', 'Alt. of Encheason'),
(24903, 'Enchest', 'v. t.', 'To inclose in a chest.'),
(24904, 'Enchisel', 'v. t.', 'To cut with a chisel.'),
(24905, 'Enchodus', 'n.', 'A genus of extinct Cretaceous fishes; -- so named from\n   their spear-shaped teeth. They were allied to the pike (Esox).'),
(24906, 'Enchoric', 'a.', 'Belonging to, or used in, a country; native; domestic;\n   popular; common; -- said especially of the written characters employed\n   by the common people of ancient Egypt, in distinction from the\n   hieroglyphics. See Demotic.'),
