(24924, 'Encomion', 'n.', 'Encomium; panegyric.'),
(24925, 'Encomium', 'n.', 'Warm or high praise; panegyric; strong commendation.'),
(24926, 'Encore', 'adv. / interj.', 'Once more; again; -- used by the auditors and\n   spectators of plays, concerts, and other entertainments, to call for a\n   repetition of a particular part.'),
(24927, 'Encore', 'n.', 'A call or demand (as, by continued applause) for a\n   repetition; as, the encores were numerous.'),
(24928, 'Encored', 'imp. & p. p.', 'of Encore'),
(24929, 'Encoring', 'p. pr. & vb. n.', 'of Encore'),
(24930, 'Encore', 'v. t.', 'To call for a repetition or reappearance of; as, to\n   encore a song or a singer.'),
(24931, 'Encowl', 'v. t.', 'To make a monk (or wearer of a cowl) of.'),
(24932, 'Encradle', 'v. t.', 'To lay in a cradle.'),
(24933, 'Encrease', 'v. t. &', 'i. [Obs.] See Increase.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(24934, 'Encrinic', 'a.', 'Alt. of Encrinital'),
(24935, 'Encrinal', 'a.', 'Alt. of Encrinital'),
(24936, 'Encrini', 'pl. ', 'of Encrinus'),
(24937, 'Encrinus', 'n.', 'A genus of fossil encrinoidea, from the Mesozoic rocks.'),
(24938, 'Encroach', 'v. i.', 'To enter by gradual steps or by stealth into the\n   possessions or rights of another; to trespass; to intrude; to trench;\n   -- commonly with on or upon; as, to encroach on a neighbor; to encroach\n   on the highway.'),
(24939, 'Encroach', 'n.', 'Encroachment.'),
(24940, 'Encrust', 'v. t.', 'To incrust. See Incrust.'),
(24941, 'Encumber', 'v. t.', 'To impede the motion or action of, as with a burden;\n   to retard with something superfluous; to weigh down; to obstruct or\n   embarrass; as, his movements were encumbered by his mantle; his mind is\n   encumbered with useless learning.'),
(24942, 'Encumber', 'v. t.', 'To load with debts, or other legal claims; as, to\n   encumber an estate with mortgages.'),
(24943, '-ency', '', 'A noun suffix having much the same meaning as -ence, but more\n   commonly signifying the quality or state; as, emergency, efficiency.\n   See -ancy.'),
(24944, 'Encyclic', 'a.', 'Alt. of Encyclical'),
(24945, 'Encyclic', 'n.', 'Alt. of Encyclical'),
(24946, 'Encyst', 'v. t.', 'To inclose in a cyst.'),
(24947, 'Encysted', 'a.', 'Inclosed in a cyst, or a sac, bladder, or vesicle; as, an\n   encysted tumor.'),
(24948, 'Ended', 'imp. & p. p.', 'of End'),
(24949, 'Ending', 'p. pr. & vb. n.', 'of End'),
(24950, 'Endable', 'a.', 'That may be ended; terminable.'),
(24951, 'End-all', 'n.', 'Complete termination.'),
(24952, 'Endamage', 'v. t.', 'To bring loss or damage to; to harm; to injure.'),
(24953, 'Endanger', 'v. t.', 'To put to hazard; to bring into danger or peril; to\n   expose to loss or injury; as, to endanger life or peace.'),
(24954, 'Endanger', 'v. t.', 'To incur the hazard of; to risk.'),
(24955, 'Endark', 'v. t.', 'To darken.'),
(24956, 'Endazzle', 'v. t.', 'To dazzle.'),
(24957, 'Endeared', 'imp. & p. p.', 'of Endear'),
(24958, 'Endear', 'v. t.', 'To make dear or beloved.'),
(24959, 'Endear', 'v. t.', 'To raise the price or cost of; to make costly or\n   expensive.'),
(24960, 'Endeavor', 'v. t.', 'To exert physical or intellectual strength for the\n   attainment of; to use efforts to effect; to strive to achieve or reach;\n   to try; to attempt.'),
(24961, 'Endeavor', 'v. i.', 'To exert one\'s self; to work for a certain end.'),
(24962, 'Endeavor', 'n.', 'An exertion of physical or intellectual strength toward\n   the attainment of an object; a systematic or continuous attempt; an\n   effort; a trial.'),
(24963, 'Endecane', 'n.', 'One of the higher hydrocarbons of the paraffin series,\n   C11H24, found as a constituent of petroleum.'),
(24964, 'Endeixis', 'n.', 'An indication.'),
(24965, 'Endemial', 'a.', 'Endemic.'),
(24966, 'Endemic', 'a.', 'Alt. of Endemical'),
(24967, 'Endemic', 'n.', 'An endemic disease.'),
(24968, 'Endenize', 'v. t.', 'To endenizen.'),
(24969, 'Ender', 'n.', 'One who, or that which, makes an end of something; as, the\n   ender of my life.'),
(24970, 'Endermic', 'a.', 'Acting through the skin, or by direct application to the\n   skin.'),
(24971, 'Enderon', 'n.', 'The deep sensitive and vascular layer of the skin and\n   mucous membranes.'),
(24972, 'Endiaper', 'v. t.', 'To decorate with a diaper pattern.'),
(24973, 'Endict', 'v. t.', 'See Indict.'),
(24974, 'Ending', 'n.', 'Termination; concluding part; result; conclusion;\n   destruction; death.'),
(24975, 'Ending', 'n.', 'The final syllable or letter of a word; the part joined to\n   the stem. See 3d Case, 5.'),
(24976, 'Endite', 'v. t.', 'See Indite.'),
(24977, 'Endive', 'n.', 'A composite herb (Cichorium Endivia). Its finely divided\n   and much curled leaves, when blanched, are used for salad.'),
(24978, 'Endless', 'a.', 'Without end; having no end or conclusion; perpetual;\n   interminable; -- applied to length, and to duration; as, an endless\n   line; endless time; endless bliss; endless praise; endless clamor.'),
(24979, 'Endless', 'a.', 'Infinite; excessive; unlimited.'),
(24980, 'Endless', 'a.', 'Without profitable end; fruitless; unsatisfying.'),
(24981, 'Endless', 'a.', 'Void of design; objectless; as, an endless pursuit.'),
(24982, 'Endlong', 'adv. & prep.', 'Lengthwise; along.'),
(24983, 'Endmost', 'a.', 'Farthest; remotest; at the very end.'),
(24984, 'Endo-', '', 'Alt. of End-'),
(24985, 'Endocarp', 'n.', 'The inner layer of a ripened or fructified ovary.'),
(24986, 'Endocyst', 'n.', 'The inner layer of the cells of Bryozoa.'),
(24987, 'Endoderm', 'n.', 'The inner layer of the skin or integument of an animal.'),
(24988, 'Endoderm', 'n.', 'The innermost layer of the blastoderm and the structures\n   derived from it; the hypoblast; the entoblast. See Illust. of Ectoderm.'),
(24989, 'Endogamy', 'n.', 'Marriage only within the tribe; a custom restricting a\n   man in his choice of a wife to the tribe to which he belongs; --\n   opposed to exogamy.'),
(24990, 'Endogen', 'n.', 'A plant which increases in size by internal growth and\n   elongation at the summit, having the wood in the form of bundles or\n   threads, irregularly distributed throughout the whole diameter, not\n   forming annual layers, and with no distinct pith. The leaves of the\n   endogens have, usually, parallel veins, their flowers are mostly in\n   three, or some multiple of three, parts, and their embryos have but a\n   single cotyledon, with the first leaves alternate. The endogens\n   constitute one of the great primary classes of plants, and included all\n   palms, true lilies, grasses, rushes, orchids, the banana, pineapple,\n   etc. See Exogen.'),
(24991, 'Endogeny', 'n.', 'Growth from within; multiplication of cells by endogenous\n   division, as in the development of one or more cells in the interior of\n   a parent cell.'),
(24992, 'Endome', 'v. t.', 'To cover as with a dome.'),
(24993, 'Endorsed', 'imp. & p. p.', 'of Endorse'),
(24994, 'Endorse', 'v. t.', 'Same as Indorse.'),
(24995, 'Endorse', 'n.', 'A subordinary, resembling the pale, but of one fourth its\n   width (according to some writers, one eighth).'),
(24996, 'Endorsee', 'n.', 'Same as Indorsee.'),
(24997, 'Endorser', 'n.', 'Same as Indorser.'),
(24998, 'Endosarc', 'n.', 'The semifluid, granular interior of certain unicellular\n   organisms, as the inner layer of sarcode in the amoeba; entoplasm;\n   endoplasta.'),
(24999, 'Endoss', 'v. t.', 'To put upon the back or outside of anything; -- the\n   older spelling of endorse.'),
(25000, 'Endowed', 'imp. & p. p.', 'of Endow'),
(25001, 'Endowing', 'p. pr. & vb. n.', 'of Endow'),
(25002, 'Endow', 'v. t.', 'To furnish with money or its equivalent, as a permanent\n   fund for support; to make pecuniary provision for; to settle an income\n   upon; especially, to furnish with dower; as, to endow a wife; to endow\n   a public institution.'),
(25003, 'Endow', 'v. t.', 'To enrich or furnish with anything of the nature of a\n   gift (as a quality or faculty); -- followed by with, rarely by of; as,\n   man is endowed by his Maker with reason; to endow with privileges or\n   benefits.'),
(25004, 'Endower', 'v. t.', 'To endow.'),
(25005, 'Endower', 'n.', 'One who endows.'),
(25006, 'Endozoa', 'n. pl.', 'See Entozoa.'),
(25007, 'Endrudge', 'v. t.', 'To make a drudge or slave of.'),
(25008, 'Endued', 'imp. & p. p.', 'of Endue'),
(25009, 'Enduing', 'p. pr. & vb. n.', 'of Endue'),
(25010, 'Endue', 'v. t.', 'To invest.'),
(25011, 'Endue', 'v. t.', 'An older spelling of Endow.'),
(25012, 'Endurant', 'a.', 'Capable of enduring fatigue, pain, hunger, etc.'),
(25013, 'Endured', 'imp. & p. p.', 'of Endure'),
(25014, 'Enduring', 'p. pr. & vb. n.', 'of Endure'),
(25015, 'Endure', 'v. i.', 'To continue in the same state without perishing; to\n   last; to remain.'),
(25016, 'Endure', 'v. i.', 'To remain firm, as under trial or suffering; to suffer\n   patiently or without yielding; to bear up under adversity; to hold out.'),
(25017, 'Endure', 'v. t.', 'To remain firm under; to sustain; to undergo; to support\n   without breaking or yielding; as, metals endure a certain degree of\n   heat without melting; to endure wind and weather.'),
(25018, 'Endure', 'v. t.', 'To bear with patience; to suffer without opposition or\n   without sinking under the pressure or affliction; to bear up under; to\n   put up with; to tolerate.'),
(25019, 'Endure', 'v. t.', 'To harden; to toughen; to make hardy.'),
(25020, 'Endurer', 'n.', 'One who, or that which, endures or lasts; one who bears,\n   suffers, or sustains.'),
(25021, 'Enduring', 'a.', 'Lasting; durable; long-suffering; as, an enduring\n   disposition.'),
(25022, 'Endways', 'adv.', 'Alt. of Endwise'),
(25023, 'Endwise', 'adv.', 'On end; erectly; in an upright position.'),
(25024, 'Endwise', 'adv.', 'With the end forward.'),
(25025, 'Endyma', 'n.', 'See Ependyma.'),
(25026, 'Endyses', 'pl. ', 'of Endysis'),
(25027, 'Endysis', 'n.', 'The act of developing a new coat of hair, a new set of\n   feathers, scales, etc.; -- opposed to ecdysis.'),
(25028, 'Enecate', 'v. t.', 'To kill off; to destroy.'),
(25029, 'Eneid', 'n.', 'Same as Aeneid.'),
(25030, 'Enemata', 'pl. ', 'of Enema'),
(25031, 'Enema', 'n.', 'An injection, or clyster, thrown into the rectum as a\n   medicine, or to impart nourishment.'),
(25032, 'Enemies', 'pl. ', 'of Enemy'),
(25033, 'Enemy', 'n.', 'One hostile to another; one who hates, and desires or\n   attempts the injury of, another; a foe; an adversary; as, an enemy of\n   or to a person; an enemy to truth, or to falsehood.'),
(25034, 'Enemy', 'a.', 'Hostile; inimical.'),
(25035, 'Energic', 'a.', 'Alt. of Energical'),
(25036, 'Energize', 'v. i.', 'To use strength in action; to act or operate with\n   force or vigor; to act in producing an effect.'),
(25037, 'Energize', 'v. t.', 'To give strength or force to; to make active; to\n   alacrify; as, to energize the will.'),
(25038, 'Energies', 'pl. ', 'of Energy'),
(25039, 'Energy', 'n.', 'Internal or inherent power; capacity of acting, operating,\n   or producing an effect, whether exerted or not; as, men possessing\n   energies may suffer them to lie inactive.'),
(25040, 'Energy', 'n.', 'Power efficiently and forcibly exerted; vigorous or\n   effectual operation; as, the energy of a magistrate.'),
(25041, 'Energy', 'n.', 'Strength of expression; force of utterance; power to\n   impress the mind and arouse the feelings; life; spirit; -- said of\n   speech, language, words, style; as, a style full of energy.'),
(25042, 'Energy', 'n.', 'Capacity for performing work.'),
(25043, 'Enervate', 'v. t.', 'To deprive of nerve, force, strength, or courage; to\n   render feeble or impotent; to make effeminate; to impair the moral\n   powers of.'),
(25044, 'Enervate', 'a.', 'Weakened; weak; without strength of force.'),
(25045, 'Enerve', 'v. t.', 'To weaken; to enervate.'),
(25046, 'Enervous', 'a.', 'Lacking nerve or force; enervated.'),
(25047, 'Enfamish', 'v. t.', 'To famish; to starve.'),
(25048, 'Enfect', 'a.', 'Contaminated with illegality.'),
(25049, 'Enfeeble', 'v. t.', 'To make feeble; to deprive of strength; to reduce the\n   strength or force of; to weaken; to debilitate.'),
(25050, 'Enfeoff', 'v. t.', 'To give a feud, or right in land, to; to invest with a\n   fief or fee; to invest (any one) with a freehold estate by the process\n   of feoffment.'),
(25051, 'Enfeoff', 'v. t.', 'To give in vassalage; to make subservient.'),
(25052, 'Enfester', 'v. t.', 'To fester.'),
(25053, 'Enfetter', 'v. t.', 'To bind in fetters; to enchain.'),
(25054, 'Enfever', 'v. t.', 'To excite fever in.'),
(25055, 'Enfierce', 'v. t.', 'To make fierce.'),
(25056, 'Enfilade', 'n.', 'A line or straight passage, or the position of that which\n   lies in a straight line.'),
(25057, 'Enfilade', 'n.', 'A firing in the direction of the length of a trench, or a\n   line of parapet or troops, etc.; a raking fire.'),
(25058, 'Enfilade', 'v. t.', 'To pierce, scour, or rake with shot in the direction\n   of the length of, as a work, or a line of troops.'),
(25059, 'Enfiled', 'p. a.', 'Having some object, as the head of a man or beast,\n   impaled upon it; as, a sword which is said to be \"enfiled of\" the thing\n   which it pierces.'),
(25060, 'Enfire', 'v. t.', 'To set on fire.'),
(25061, 'Enflesh', 'v. t.', 'To clothe with flesh.'),
(25062, 'Enflower', 'v. t.', 'To cover or deck with flowers.'),
(25063, 'Enfold', 'v. t.', 'To infold. See Infold.'),
(25064, 'Enforced', 'imp. & p. p.', 'of Enforce'),
(25065, 'Enforce', 'v. t.', 'To put force upon; to force; to constrain; to compel;\n   as, to enforce obedience to commands.'),
(25066, 'Enforce', 'v. t.', 'To make or gain by force; to obtain by force; as, to\n   enforce a passage.'),
(25067, 'Enforce', 'v. t.', 'To put in motion or action by violence; to drive.'),
(25068, 'Enforce', 'v. t.', 'To give force to; to strengthen; to invigorate; to urge\n   with energy; as, to enforce arguments or requests.'),
(25069, 'Enforce', 'v. t.', 'To put in force; to cause to take effect; to give\n   effect to; to execute with vigor; as, to enforce the laws.'),
(25070, 'Enforce', 'v. t.', 'To urge; to ply hard; to lay much stress upon.'),
(25071, 'Enforce', 'v. i.', 'To attempt by force.'),
(25072, 'Enforce', 'v. i.', 'To prove; to evince.'),
(25073, 'Enforce', 'v. i.', 'To strengthen; to grow strong.'),
(25074, 'Enforce', 'n.', 'Force; strength; power.'),
(25075, 'Enforced', 'a.', 'Compelled; forced; not voluntary.'),
(25076, 'Enforcer', 'n.', 'One who enforces.'),
(25077, 'Enforest', 'v. t.', 'To turn into a forest.'),
(25078, 'Enform', 'v. t.', 'To form; to fashion.'),
(25079, 'Enframe', 'v. t.', 'To inclose, as in a frame.'),
(25080, 'Enfree', 'v. t.', 'To set free.'),
(25081, 'Enfreeze', 'v. t.', 'To freeze; to congeal.'),
(25082, 'Engaged', 'imp. & p. p.', 'of Engage'),
(25083, 'Engaging', 'p. pr. & vb. n.', 'of Engage'),
(25084, 'Engage', 'v. t.', 'To put under pledge; to pledge; to place under\n   obligations to do or forbear doing something, as by a pledge, oath, or\n   promise; to bind by contract or promise.'),
(25085, 'Engage', 'v. t.', 'To gain for service; to bring in as associate or aid; to\n   enlist; as, to engage friends to aid in a cause; to engage men for\n   service.'),
(25086, 'Engage', 'v. t.', 'To gain over; to win and attach; to attract and hold; to\n   draw.'),
(25087, 'Engage', 'v. t.', 'To employ the attention and efforts of; to occupy; to\n   engross; to draw on.'),
(25088, 'Engage', 'v. t.', 'To enter into contest with; to encounter; to bring to\n   conflict.'),
(25089, 'Engage', 'v. t.', 'To come into gear with; as, the teeth of one cogwheel\n   engage those of another, or one part of a clutch engages the other\n   part.'),
(25090, 'Engage', 'v. i.', 'To promise or pledge one\'s self; to enter into an\n   obligation; to become bound; to warrant.'),
(25091, 'Engage', 'v. i.', 'To embark in a business; to take a part; to employ or\n   involve one\'s self; to devote attention and effort; to enlist; as, to\n   engage in controversy.'),
(25092, 'Engage', 'v. i.', 'To enter into conflict; to join battle; as, the armies\n   engaged in a general battle.'),
(25093, 'Engage', 'v. i.', 'To be in gear, as two cogwheels working together.'),
(25094, 'Engaged', 'a.', 'Occupied; employed; busy.'),
(25095, 'Engaged', 'a.', 'Pledged; promised; especially, having the affections\n   pledged; promised in marriage; affianced; betrothed.'),
(25096, 'Engaged', 'a.', 'Greatly interested; of awakened zeal; earnest.'),
(25097, 'Engaged', 'a.', 'Involved; esp., involved in a hostile encounter; as, the\n   engaged ships continued the fight.'),
(25098, 'Engager', 'n.', 'One who enters into an engagement or agreement; a surety.'),
(25099, 'Engaging', 'a.', 'Tending to draw the attention or affections; attractive;\n   as, engaging manners or address.'),
(25100, 'Engaol', 'v. t.', 'To put in jail; to imprison.'),
(25101, 'Engender', 'v. t.', 'To produce by the union of the sexes; to beget.'),
(25102, 'Engender', 'v. t.', 'To cause to exist; to bring forth; to produce; to sow\n   the seeds of; as, angry words engender strife.'),
(25103, 'Engender', 'v. i.', 'To assume form; to come into existence; to be caused\n   or produced.'),
(25104, 'Engender', 'v. i.', 'To come together; to meet, as in sexual embrace.'),
(25105, 'Engender', 'n.', 'One who, or that which, engenders.'),
(25106, 'Engild', 'v. t.', 'To gild; to make splendent.'),
(25107, 'Engine', 'n.', '(Pronounced, in this sense, ////.) Natural capacity;\n   ability; skill.'),
(25108, 'Engine', 'n.', 'Anything used to effect a purpose; any device or\n   contrivance; an agent.'),
(25109, 'Engine', 'n.', 'Any instrument by which any effect is produced; especially,\n   an instrument or machine of war or torture.'),
(25110, 'Engine', 'n.', 'A compound machine by which any physical power is applied\n   to produce a given physical effect.'),
(25111, 'Engine', 'v. t.', 'To assault with an engine.'),
(25112, 'Engine', 'v. t.', 'To equip with an engine; -- said especially of steam\n   vessels; as, vessels are often built by one firm and engined by\n   another.'),
(25113, 'Engine', 'v. t.', '(Pronounced, in this sense, /////.) To rack; to torture.'),
(25114, 'Engineer', 'n.', 'A person skilled in the principles and practice of any\n   branch of engineering. See under Engineering, n.'),
(25115, 'Engineer', 'n.', 'One who manages as engine, particularly a steam engine;\n   an engine driver.'),
(25116, 'Engineer', 'n.', 'One who carries through an enterprise by skillful or\n   artful contrivance; an efficient manager.'),
(25117, 'Engineer', 'v. t.', 'To lay out or construct, as an engineer; to perform\n   the work of an engineer on; as, to engineer a road.'),
(25118, 'Engineer', 'v. t.', 'To use contrivance and effort for; to guide the course\n   of; to manage; as, to engineer a bill through Congress.'),
(25119, 'Enginer', 'n.', 'A contriver; an inventor; a contriver of engines.'),
(25120, 'Enginery', 'n.', 'The act or art of managing engines, or artillery.'),
(25121, 'Enginery', 'n.', 'Engines, in general; instruments of war.'),
(25122, 'Enginery', 'n.', 'Any device or contrivance; machinery; structure or\n   arrangement.'),
(25123, 'Enginous', 'a.', 'Pertaining to an engine.'),
(25124, 'Enginous', 'a.', 'Contrived with care; ingenious.'),
(25125, 'Engirded', 'imp. & p. p.', 'of Engird'),
(25126, 'Engirt', '', 'of Engird'),
(25127, 'Engird', 'v. t.', 'To gird; to encompass.'),
(25128, 'Engirdle', 'v. t.', 'To surround as with a girdle; to girdle.'),
(25129, 'Engirt', 'v. t.', 'To engird.'),
(25130, 'Engle', 'n.', 'A favorite; a paramour; an ingle.'),
(25131, 'Engle', 'v. t.', 'To cajole or coax, as favorite.'),
(25132, 'English', 'a.', 'Of or pertaining to England, or to its inhabitants, or to\n   the present so-called Anglo-Saxon race.'),
(25133, 'English', 'a.', 'See 1st Bond, n., 8.'),
(25134, 'English', 'n.', 'Collectively, the people of England; English people or\n   persons.'),
(25135, 'English', 'n.', 'The language of England or of the English nation, and of\n   their descendants in America, India, and other countries.'),
(25136, 'English', 'n.', 'A kind of printing type, in size between Pica and Great\n   Primer. See Type.'),
(25137, 'English', 'n.', 'A twist or spinning motion given to a ball in striking it\n   that influences the direction it will take after touching a cushion or\n   another ball.'),
(25138, 'English', 'v. t.', 'To translate into the English language; to Anglicize;\n   hence, to interpret; to explain.'),
(25139, 'English', 'v. t.', 'To strike (the cue ball) in such a manner as to give it\n   in addition to its forward motion a spinning motion, that influences\n   its direction after impact on another ball or the cushion.'),
(25140, 'Engloom', 'v. t.', 'To make gloomy.'),
(25141, 'Englue', 'v. t.', 'To join or close fast together, as with glue; as, a\n   coffer well englued.'),
(25142, 'Englut', 'v. t.', 'To swallow or gulp down.'),
(25143, 'Englut', 'v. t.', 'To glut.'),
(25144, 'Engore', 'v. t.', 'To gore; to pierce; to lacerate.'),
(25145, 'Engore', 'v. t.', 'To make bloody.'),
(25146, 'Engorged', 'imp. & p. p.', 'of Engorge'),
(25147, 'Engorge', 'v. t.', 'To gorge; to glut.'),
(25148, 'Engorge', 'v. t.', 'To swallow with greediness or in large quantities; to\n   devour.'),
(25149, 'Engorge', 'v. i.', 'To feed with eagerness or voracity; to stuff one\'s self\n   with food.'),
(25150, 'Engorged', 'p. a.', 'Swallowed with greediness, or in large draughts.'),
(25151, 'Engorged', 'p. a.', 'Filled to excess with blood or other liquid;\n   congested.'),
(25152, 'Engouled', 'a.', 'Partly swallowed; disappearing in the jaws of anything;\n   as, an infant engouled by a serpent; said also of an ordinary, when its\n   two ends to issue from the mouths of lions, or the like; as, a bend\n   engouled.'),
(25153, 'Engoulee', 'a.', 'Same as Engouled.'),
(25154, 'Engraff', 'v. t.', 'To graft; to fix deeply.'),
(25155, 'Engraft', 'v. t.', 'See Ingraft.'),
(25156, 'Engrail', 'v. t.', 'To variegate or spot, as with hail.'),
(25157, 'Engrail', 'v. t.', 'To indent with small curves. See Engrailed.'),
(25158, 'Engrail', 'v. i.', 'To form an edging or border; to run in curved or\n   indented lines.'),
(25159, 'Engrain', 'v. t.', 'To dye in grain, or of a fast color. See Ingrain.'),
(25160, 'Engrain', 'v. t.', 'To incorporate with the grain or texture of anything;\n   to infuse deeply. See Ingrain.'),
(25161, 'Engrain', 'v. t.', 'To color in imitation of the grain of wood; to grain.\n   See Grain, v. t., 1.'),
(25162, 'Engrasp', 'v. t.', 'To grasp; to grip.'),
(25163, 'Engrave', 'v. t.', 'To deposit in the grave; to bury.'),
(25164, 'Engraved', 'imp.', 'of Engrave'),
(25165, 'Engraved', 'p. p.', 'of Engrave'),
(25166, 'Engraven', '', 'of Engrave'),
(25167, 'Engrave', 'v. t.', 'To cut in; to make by incision.'),
