(25409, 'Enter', 'v. t.', 'To pass within the limits of; to attain; to begin; to\n   commence upon; as, to enter one\'s teens, a new era, a new dispensation.'),
(25410, 'Enter', 'v. t.', 'To cause to go (into), or to be received (into); to put\n   in; to insert; to cause to be admitted; as, to enter a knife into a\n   piece of wood, a wedge into a log; to enter a boy at college, a horse\n   for a race, etc.'),
(25411, 'Enter', 'v. t.', 'To inscribe; to enroll; to record; as, to enter a name,\n   or a date, in a book, or a book in a catalogue; to enter the\n   particulars of a sale in an account, a manifest of a ship or of\n   merchandise at the customhouse.'),
(25412, 'Enter', 'v. t.', 'To go into or upon, as lands, and take actual possession\n   of them.'),
(25413, 'Enter', 'v. t.', 'To place in regular form before the court, usually in\n   writing; to put upon record in proper from and order; as, to enter a\n   writ, appearance, rule, or judgment.'),
(25414, 'Enter', 'v. t.', 'To make report of (a vessel or her cargo) at the\n   customhouse; to submit a statement of (imported goods), with the\n   original invoices, to the proper officer of the customs for estimating\n   the duties. See Entry, 4.'),
(25415, 'Enter', 'v. t.', 'To file or inscribe upon the records of the land office\n   the required particulars concerning (a quantity of public land) in\n   order to entitle a person to a right pf preemption.'),
(25416, 'Enter', 'v. t.', 'To deposit for copyright the title or description of (a\n   book, picture, map, etc.); as, \"entered according to act of Congress.\"'),
(25417, 'Enter', 'v. t.', 'To initiate; to introduce favorably.'),
(25418, 'Enter', 'v. i.', 'To go or come in; -- often with in used pleonastically;\n   also, to begin; to take the first steps.'),
(25419, 'Enter', 'v. i.', 'To get admission; to introduce one\'s self; to penetrate;\n   to form or constitute a part; to become a partaker or participant; to\n   share; to engage; -- usually with into; sometimes with on or upon; as,\n   a ball enters into the body; water enters into a ship; he enters into\n   the plan; to enter into a quarrel; a merchant enters into partnership\n   with some one; to enter upon another\'s land; the boy enters on his\n   tenth year; to enter upon a task; lead enters into the composition of\n   pewter.'),
(25420, 'Enter', 'v. i.', 'To penetrate mentally; to consider attentively; -- with\n   into.'),
(25421, 'Enterer', 'n.', 'One who makes an entrance or beginning.'),
(25422, 'Enteric', 'a.', 'Of or pertaining to the enteron, or alimentary canal;\n   intestinal.'),
(25423, 'Enteron', 'n.', 'The whole alimentary, or enteric, canal.'),
(25424, 'Entheal', 'a.', 'Alt. of Enthean'),
(25425, 'Enthean', 'a.', 'Divinely inspired; wrought up to enthusiasm.'),
(25426, 'Entheasm', 'n.', 'Inspiration; enthusiasm.'),
(25427, 'Entheat', 'a.', 'Divinely inspired.'),
(25428, 'Entheic', 'a.', 'Caused by a morbifie virus implanted in the system; as, an\n   enthetic disease like syphilis.'),
(25429, 'Enthrall', 'v. t.', 'To hold in thrall; to enslave. See Inthrall.'),
(25430, 'Enthrill', 'v. t.', 'To pierce; to thrill.'),
(25431, 'Enthrone', 'v. t.', 'To seat on a throne; to exalt to the seat of royalty\n   or of high authority; hence, to invest with sovereign authority or\n   dignity.'),
(25432, 'Enthrone', 'v. t.', 'To induct, as a bishop, into the powers and privileges\n   of a vacant see.'),
(25433, 'Enthuse', 'v. t. & i.', 'To make or become enthusiastic.'),
(25434, 'Enticed', 'imp. & p. p.', 'of Entice'),
(25435, 'Enticing', 'p. pr. & vb. n.', 'of Entice'),
(25436, 'Entice', 'v. t.', 'To draw on, by exciting hope or desire; to allure; to\n   attract; as, the bait enticed the fishes. Often in a bad sense: To lead\n   astray; to induce to evil; to tempt; as, the sirens enticed them to\n   listen.'),
(25437, 'Enticer', 'n.', 'One who entices; one who incites or allures to evil.'),
(25438, 'Enticing', 'a.', 'That entices; alluring.'),
(25439, 'Entierty', 'n.', 'See Entirety.'),
(25440, 'Entire', 'a.', 'Complete in all parts; undivided; undiminished; whole; full\n   and perfect; not deficient; as, the entire control of a business;\n   entire confidence, ignorance.'),
(25441, 'Entire', 'a.', 'Without mixture or alloy of anything; unqualified; morally\n   whole; pure; faithful.'),
(25442, 'Entire', 'a.', 'Consisting of a single piece, as a corolla.'),
(25443, 'Entire', 'a.', 'Having an evenly continuous edge, as a leaf which has no\n   kind of teeth.'),
(25444, 'Entire', 'a.', 'Not gelded; -- said of a horse.'),
(25445, 'Entire', 'a.', 'Internal; interior.'),
(25446, 'Entire', 'n.', 'Entirely.'),
(25447, 'Entire', 'n.', 'A name originally given to a kind of beer combining\n   qualities of different kinds of beer.'),
(25448, 'Entirely', 'adv.', 'In an entire manner; wholly; completely; fully; as, the\n   trace is entirely lost.'),
(25449, 'Entirely', 'adv.', 'Without alloy or mixture; truly; sincerely.'),
(25450, 'Entirety', 'n.', 'The state of being entire; completeness; as, entirely of\n   interest.'),
(25451, 'Entirety', 'n.', 'That which is entire; the whole.'),
(25452, 'Entitled', 'imp. & p. p.', 'of Entitle'),
(25453, 'Entitle', 'v. t.', 'To give a title to; to affix to as a name or\n   appellation; hence, also, to dignify by an honorary designation; to\n   denominate; to call; as, to entitle a book \"Commentaries;\" to entitle a\n   man \"Honorable.\"'),
(25454, 'Entitle', 'v. t.', 'To give a claim to; to qualify for, with a direct\n   object of the person, and a remote object of the thing; to furnish with\n   grounds for seeking or claiming with success; as, an officer\'s talents\n   entitle him to command.'),
(25455, 'Entitle', 'v. t.', 'To attribute; to ascribe.'),
(25456, 'Entitule', 'v. t.', 'To entitle.'),
(25457, 'Entities', 'pl. ', 'of Entity'),
(25458, 'Entity', 'n.', 'A real being, whether in thought (as an ideal conception)\n   or in fact; being; essence; existence.'),
(25459, 'Ento-', '', 'A combining form signifying within; as, entoblast.'),
(25460, 'Entoderm', 'n.', 'See Endoderm, and Illust. of Blastoderm.'),
(25461, 'Entoiled', 'imp. & p. p.', 'of Entoil'),
(25462, 'Entoil', 'v. t.', 'To take with toils or bring into toils; to insnare.'),
(25463, 'Entombed', 'imp. & p. p.', 'of Entomb'),
(25464, 'Entomb', 'v. t.', 'To deposit in a tomb, as a dead body; to bury; to inter;\n   to inhume.'),
(25465, 'Entomere', 'n.', 'The more granular cells, which finally become internal,\n   in many segmenting ova, as those of mammals.'),
(25466, 'Entomic', 'a.', 'Alt. of Entomical'),
(25467, 'Entomoid', 'a.', 'Resembling an insect.'),
(25468, 'Entomoid', 'n.', 'An object resembling an insect.'),
(25469, 'Entonic', 'a.', 'Having great tension, or exaggerated action.'),
(25470, 'Entoptic', 'a.', 'Relating to objects situated within the eye; esp.,\n   relating to the perception of objects in one\'s own eye.'),
(25471, 'Entotic', 'a.', 'Pertaining to the interior of the ear.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(25472, 'Entozoa', 'n. pl.', 'A group of worms, including the tapeworms, flukes,\n   roundworms, etc., most of which live parasitically in the interior of\n   other animals; the Helminthes.'),
(25473, 'Entozoa', 'n. pl.', 'An artificial group, including all kinds of animals\n   living parasitically in others.'),
(25474, 'Entozoal', 'a.', 'Alt. of Entozoic'),
(25475, 'Entozoic', 'a.', 'Pertaining to, or consisting of, the Entozoa.'),
(25476, 'Entozoa', 'pl. ', 'of Entozoon'),
(25477, 'Entozoon', 'n.', 'One of the Entozoa.'),
(25478, 'Entracte', 'n.', 'The interval of time which occurs between the\n   performance of any two acts of a drama.'),
(25479, 'Entracte', 'n.', 'A dance, piece of music, or interlude, performed between\n   two acts of a drama.'),
(25480, 'Entrail', 'v. t.', 'To interweave; to intertwine.'),
(25481, 'Entrail', 'n.', 'Entanglement; fold.'),
(25482, 'Entrails', 'n. pl.', 'The internal parts of animal bodies; the bowels; the\n   guts; viscera; intestines.'),
(25483, 'Entrails', 'n. pl.', 'The internal parts; as, the entrails of the earth.'),
(25484, 'Entrain', 'v. t.', 'To draw along as a current does; as, water entrained by\n   steam.'),
(25485, 'Entrain', 'v. t.', 'To put aboard a railway train; as, to entrain a\n   regiment.'),
(25486, 'Entrain', 'v. i.', 'To go aboard a railway train; as, the troops entrained\n   at the station.'),
(25487, 'Entrance', 'n.', 'The act of entering or going into; ingress; as, the\n   entrance of a person into a house or an apartment; hence, the act of\n   taking possession, as of property, or of office; as, the entrance of an\n   heir upon his inheritance, or of a magistrate into office.'),
(25488, 'Entrance', 'n.', 'Liberty, power, or permission to enter; as, to give\n   entrance to friends.'),
(25489, 'Entrance', 'n.', 'The passage, door, or gate, for entering.'),
(25490, 'Entrance', 'n.', 'The entering upon; the beginning, or that with which the\n   beginning is made; the commencement; initiation; as, a difficult\n   entrance into business.'),
(25491, 'Entrance', 'n.', 'The causing to be entered upon a register, as a ship or\n   goods, at a customhouse; an entering; as, his entrance of the arrival\n   was made the same day.'),
(25492, 'Entrance', 'n.', 'The angle which the bow of a vessel makes with the water\n   at the water line.'),
(25493, 'Entrance', 'n.', 'The bow, or entire wedgelike forepart of a vessel, below\n   the water line.'),
(25494, 'Entrance', 'v. t.', 'To put into a trance; to make insensible to present\n   objects.'),
(25495, 'Entrance', 'v. t.', 'To put into an ecstasy; to ravish with delight or\n   wonder; to enrapture; to charm.'),
(25496, 'Entrant', 'n.', 'One who enters; a beginner.'),
(25497, 'Entrant', 'n.', 'An applicant for admission.'),
(25498, 'Entrap', 'v. t.', 'To catch in a trap; to insnare; hence, to catch, as in a\n   trap, by artifices; to involve in difficulties or distresses; to catch\n   or involve in contradictions; as, to be entrapped by the devices of\n   evil men.'),
(25499, 'Entreat', 'v. t.', 'To treat, or conduct toward; to deal with; to use.'),
(25500, 'Entreat', 'v. t.', 'To treat with, or in respect to, a thing desired;\n   hence, to ask earnestly; to beseech; to petition or pray with urgency;\n   to supplicate; to importune.'),
(25501, 'Entreat', 'v. t.', 'To beseech or supplicate successfully; to prevail upon\n   by prayer or solicitation; to persuade.'),
(25502, 'Entreat', 'v. t.', 'To invite; to entertain.'),
(25503, 'Entreat', 'v. i.', 'To treat or discourse; hence, to enter into\n   negotiations, as for a treaty.'),
(25504, 'Entreat', 'v. i.', 'To make an earnest petition or request.'),
(25505, 'Entreat', 'n.', 'Entreaty.'),
(25506, 'Entreaty', 'n.', 'Treatment; reception; entertainment.'),
(25507, 'Entreaty', 'n.', 'The act of entreating or beseeching; urgent prayer;\n   earnest petition; pressing solicitation.'),
(25508, 'Entree', 'n.', 'A coming in, or entrance; hence, freedom of access;\n   permission or right to enter; as, to have the entree of a house.'),
(25509, 'Entree', 'n.', 'In French usage, a dish served at the beginning of dinner\n   to give zest to the appetite; in English usage, a side dish, served\n   with a joint, or between the courses, as a cutlet, scalloped oysters,\n   etc.'),
(25510, 'Entrench', 'v. t.', 'See Intrench.'),
(25511, 'Entrepot', 'n.', 'A warehouse; a magazine for depositing goods, stores,\n   etc.; a mart or place where merchandise is deposited; as, an entrepot\n   for shipping goods in transit.'),
(25512, 'Entresol', 'n.', 'A low story between two higher ones, usually between the\n   ground floor and the first story; mezzanine.'),
(25513, 'Entrick', 'v. t.', 'To trick, to perplex.'),
(25514, 'Entropy', 'n.', 'A certain property of a body, expressed as a measurable\n   quantity, such that when there is no communication of heat the quantity\n   remains constant, but when heat enters or leaves the body the quantity\n   increases or diminishes. If a small amount, h, of heat enters the body\n   when its temperature is t in the thermodynamic scale the entropy of the\n   body is increased by h / t. The entropy is regarded as measured from\n   some standard temperature and pressure. Sometimes called the\n   thermodynamic function.'),
(25515, 'Entrust', 'v. t.', 'See Intrust.'),
(25516, 'Entries', 'pl. ', 'of Entry'),
(25517, 'Entry', 'n.', 'The act of entering or passing into or upon; entrance;\n   ingress; hence, beginnings or first attempts; as, the entry of a person\n   into a house or city; the entry of a river into the sea; the entry of\n   air into the blood; an entry upon an undertaking.'),
(25518, 'Entry', 'n.', 'The act of making or entering a record; a setting down in\n   writing the particulars, as of a transaction; as, an entry of a sale;\n   also, that which is entered; an item.'),
(25519, 'Entry', 'n.', 'That by which entrance is made; a passage leading into a\n   house or other building, or to a room; a vestibule; an adit, as of a\n   mine.'),
(25520, 'Entry', 'n.', 'The exhibition or depositing of a ship\'s papers at the\n   customhouse, to procure license to land goods; or the giving an account\n   of a ship\'s cargo to the officer of the customs, and obtaining his\n   permission to land the goods. See Enter, v. t., 8, and Entrance, n., 5.'),
(25521, 'Entry', 'n.', 'The actual taking possession of lands or tenements, by\n   entering or setting foot on them.'),
(25522, 'Entry', 'n.', 'A putting upon record in proper form and order.'),
(25523, 'Entry', 'n.', 'The act in addition to breaking essential to constitute the\n   offense or burglary.'),
(25524, 'Entryng', 'n.', 'Am entrance.'),
(25525, 'Entune', 'v. t.', 'To tune; to intone.'),
(25526, 'Entwine', 'v. t.', 'To twine, twist, or wreathe together or round.'),
(25527, 'Entwine', 'v. i.', 'To be twisted or twined.'),
(25528, 'Entwist', 'v. t.', 'To twist or wreathe round; to intwine.'),
(25529, 'Enure', 'v. t.', 'See Inure.'),
(25530, 'Enuresis', 'n.', 'An involuntary discharge of urine; incontinence of urine.'),
(25531, 'Envassal', 'v. t.', 'To make a vassal of.'),
(25532, 'Envault', 'v. t.', 'To inclose in a vault; to entomb.'),
(25533, 'Enveigle', 'v. t.', 'To entice. See Inveigle.'),
(25534, 'Envelop', 'v. t.', 'To put a covering about; to wrap up or in; to inclose\n   within a case, wrapper, integument or the like; to surround entirely;\n   as, to envelop goods or a letter; the fog envelops a ship.'),
(25535, 'Envelope', 'n.', 'Alt. of Envelop'),
(25536, 'Envelop', 'n.', 'That which envelops, wraps up, encases, or surrounds; a\n   wrapper; an inclosing cover; esp., the cover or wrapper of a document,\n   as of a letter.'),
(25537, 'Envelop', 'n.', 'The nebulous covering of the head or nucleus of a comet;\n   -- called also coma.'),
(25538, 'Envelop', 'n.', 'A work of earth, in the form of a single parapet or of a\n   small rampart. It is sometimes raised in the ditch and sometimes beyond\n   it.'),
(25539, 'Envelop', 'n.', 'A curve or surface which is tangent to each member of a\n   system of curves or surfaces, the form and position of the members of\n   the system being allowed to vary according to some continuous law.\n   Thus, any curve is the envelope of its tangents.'),
(25540, 'Envelop', 'n.', 'A set of limits for the performance capabilities of some\n   type of machine, originally used to refer to aircraft. Now also used\n   metaphorically to refer to capabilities of any system in general,\n   including human organizations, esp. in the phrase push the envelope. It\n   is used to refer to the maximum performance available at the current\n   state of the technology, and therefore refers to a class of machines in\n   general, not a specific machine.'),
(25541, 'Envenime', 'v. t.', 'To envenom.'),
(25542, 'Envenom', 'v. t.', 'To taint or impregnate with venom, or any substance\n   noxious to life; to poison; to render dangerous or deadly by poison, as\n   food, drink, a weapon; as, envenomed meat, wine, or arrow; also, to\n   poison (a person) by impregnating with venom.'),
(25543, 'Envenom', 'v. t.', 'To taint or impregnate with bitterness, malice, or\n   hatred; to imbue as with venom; to imbitter.'),
(25544, 'Enviable', 'a.', 'Fitted to excite envy; capable of awakening an ardent\n   desire to posses or to resemble.'),
(25545, 'Envie', 'v. i.', 'To vie; to emulate; to strive.'),
(25546, 'Envier', 'n.', 'One who envies; one who desires inordinately what another\n   possesses.'),
(25547, 'Envigor', 'v. t.', 'To invigorate.'),
(25548, 'Envious', 'a.', 'Malignant; mischievous; spiteful.'),
(25549, 'Envious', 'a.', 'Feeling or exhibiting envy; actuated or directed by, or\n   proceeding from, envy; -- said of a person, disposition, feeling, act,\n   etc.; jealously pained by the excellence or good fortune of another;\n   maliciously grudging; -- followed by of, at, and against; as, an\n   envious man, disposition, attack; envious tongues.'),
(25550, 'Envious', 'a.', 'Inspiring envy.'),
(25551, 'Envious', 'a.', 'Excessively careful; cautious.'),
(25552, 'Environ', 'v. t.', 'To surround; to encompass; to encircle; to hem in; to\n   be round about; to involve or envelop.'),
(25553, 'Environ', 'adv.', 'About; around.'),
(25554, 'Environs', 'n. pl.', 'The parts or places which surround another place, or\n   lie in its neighborhood; suburbs; as, the environs of a city or town.'),
(25555, 'Envisage', 'v. t.', 'To look in the face of; to apprehend; to regard.'),
(25556, 'Envolume', 'v. t.', 'To form into, or incorporate with, a volume.'),
(25557, 'Envolup', 'v. t.', 'To wrap up; to envelop.'),
(25558, 'Envoy', 'n.', 'One dispatched upon an errand or mission; a messenger; esp.,\n   a person deputed by a sovereign or a government to negotiate a treaty,\n   or transact other business, with a foreign sovereign or government; a\n   minister accredited to a foreign government. An envoy\'s rank is below\n   that of an ambassador.'),
(25559, 'Envoy', 'n.', 'An explanatory or commendatory postscript to a poem, essay,\n   or book; -- also in the French from, l\'envoi.'),
(25560, 'Envies', 'pl. ', 'of Envy'),
(25561, 'Envied', 'imp. & p. p.', 'of Envy'),
(25562, 'Envying', 'p. pr. & vb. n.', 'of Envy'),
(25563, 'Envyned', 'a.', 'Stored or furnished with wine.'),
(25564, 'Enwall', 'v. t.', 'See Inwall.'),
(25565, 'Enwallow', 'v. t.', 'To plunge into, or roll in, flith; to wallow.'),
(25566, 'Enwheel', 'v. t.', 'To encircle.'),
(25567, 'Enwiden', 'v. t.', 'To widen.'),
(25568, 'Enwind', 'v. t.', 'To wind about; to encircle.'),
(25569, 'Enwoman', 'v. t.', 'To endow with the qualities of a woman.'),
(25570, 'Enwombed', 'imp. & p. p.', 'of Enwomb'),
(25571, 'Enwomb', 'v. t.', 'To conceive in the womb.'),
(25572, 'Enwomb', 'v. t.', 'To bury, as it were in a womb; to hide, as in a gulf,\n   pit, or cavern.'),
(25573, 'Enwrap', 'v. t.', 'To envelop. See Inwrap.'),
(25574, 'Enzootic', 'a.', 'Afflicting animals; -- used of a disease affecting the\n   animals of a district. It corresponds to an endemic disease among men.'),
(25575, 'Enzyme', 'n.', 'An unorganized or unformed ferment, in distinction from an\n   organized or living ferment; a soluble, or chemical, ferment. Ptyalin,\n   pepsin, diastase, and rennet are good examples of enzymes.'),
(25576, 'Eocene', 'a.', 'Pertaining to the first in time of the three subdivisions\n   into which the Tertiary formation is divided by geologists, and\n   alluding to the approximation in its life to that of the present era;\n   as, Eocene deposits.'),
(25577, 'Eocene', 'n.', 'The Eocene formation.'),
(25578, 'Eolian', 'a.', 'Aeolian.'),
(25579, 'Eolian', 'a.', 'Formed, or deposited, by the action of wind, as dunes.'),
(25580, 'Eolic', 'a. & n.', 'See Aeolic.'),
(25581, 'Eolipile', 'n.', 'Same as Aeolipile.'),
(25582, 'Eolis', 'n.', 'A genus of nudibranch mollusks having clusters of branchial\n   papillae along the back. See Ceratobranchia.'),
(25583, 'Eophyte', 'n.', 'A fossil plant which is found in the lowest beds of the\n   Silurian age.'),
(25584, 'Eophytic', 'a.', 'Of or pertaining to eophytes.'),
(25585, 'Eosaurus', 'n.', 'An extinct marine reptile from the coal measures of Nova\n   Scotia; -- so named because supposed to be of the earliest known\n   reptiles.'),
(25586, 'Eosin', 'n.', 'A yellow or brownish red dyestuff obtained by the action of\n   bromine on fluorescein, and named from the fine rose-red which it\n   imparts to silk. It is also used for making a fine red ink. Its\n   solution is fluorescent.'),
(25587, 'Eozoic', 'a.', 'Of or pertaining to rocks or strata older than the\n   Paleozoic, in many of which the eozoon has been found.'),
(25588, 'Eozoons', 'pl. ', 'of Eozoon'),
(25589, 'Eozoa', 'pl. ', 'of Eozoon'),
(25590, 'Eozoon', 'n.', 'A peculiar structure found in the Archaean limestones of\n   Canada and other regions. By some geologists it is believed to be a\n   species of gigantic Foraminifera, but others consider it a concretion,\n   without organic structure.'),
(25591, 'Eozoonal', 'a.', 'Pertaining to the eozoon; containing eozoons; as,\n   eozoonal limestone.'),
(25592, 'Epacris', 'n.', 'A genus of shrubs, natives of Australia, New Zealand,\n   etc., having pretty white, red, or purple blossoms, and much resembling\n   heaths.'),
(25593, 'Epact', 'n.', 'The moon\'s age at the beginning of the calendar year, or the\n   number of days by which the last new moon has preceded the beginning of\n   the year.'),
(25594, 'Epagoge', 'n.', 'The adducing of particular examples so as to lead to a\n   universal conclusion; the argument by induction.'),
(25595, 'Epagogic', 'a.', 'Inductive.'),
(25596, 'Epalate', 'a.', 'Without palpi.'),
(25597, 'Epanodos', 'n.', 'A figure of speech in which the parts of a sentence or\n   clause are repeated in inverse order'),
(25598, 'Epanody', 'n.', 'The abnormal change of an irregular flower to a regular\n   form; -- considered by evolutionists to be a reversion to an ancestral\n   condition.'),
(25599, 'Eparch', 'n.', 'In ancient Greece, the governor or perfect of a province;\n   in modern Greece, the ruler of an eparchy.'),
(25600, 'Eparchy', 'n.', 'A province, prefecture, or territory, under the\n   jurisdiction of an eparch or governor; esp., in modern Greece, one of\n   the larger subdivisions of a monarchy or province of the kingdom; in\n   Russia, a diocese or archdiocese.'),
(25601, 'Epaule', 'n.', 'The shoulder of a bastion, or the place where its face and\n   flank meet and form the angle, called the angle of the shoulder.'),
(25602, 'Epaulet', 'n.', 'Alt. of Epaulette'),
(25603, 'Epaxial', 'a.', 'Above, or on the dorsal side of, the axis of the skeleton;\n   episkeletal.'),
(25604, 'Epeira', 'n.', 'A genus of spiders, including the common garden spider (E.\n   diadema). They spin geometrical webs. See Garden spider.'),
(25605, 'Ependyma', 'n.', 'The epithelial lining of the ventricles of the brain and\n   the canal of the spinal cord; endyma; ependymis.'),
(25606, 'Epenetic', 'a.', 'Bestowing praise; eulogistic; laudatory.'),
(25607, 'Epergne', 'n.', 'A centerpiece for table decoration, usually consisting of\n   several dishes or receptacles of different sizes grouped together in an\n   ornamental design.'),
(25608, 'Eperlan', 'n.', 'The European smelt (Osmerus eperlanus).'),
(25609, 'Ephah', 'n.', 'Alt. of Epha'),
(25610, 'Ephemera', 'n.', 'A fever of one day\'s continuance only.'),
(25611, 'Ephemera', 'n.', 'A genus of insects including the day flies, or ephemeral\n   flies. See Ephemeral fly, under Ephemeral.'),
(25612, 'Ephemera', 'pl. ', 'of Ephemeron'),
(25613, 'Ephesian', 'a.', 'Of or pertaining to Ephesus, an ancient city of Ionia, in\n   Asia Minor.'),
(25614, 'Ephesian', 'n.', 'A native of Ephesus.'),
(25615, 'Ephesian', 'n.', 'A jolly companion; a roisterer.'),
(25616, 'Ephod', 'n.', 'A part of the sacerdotal habit among Jews, being a covering\n   for the back and breast, held together on the shoulders by two clasps\n   or brooches of onyx stones set in gold, and fastened by a girdle of the\n   same stuff as the ephod. The ephod for the priests was of plain linen;\n   that for the high priest was richly embroidered in colors. The\n   breastplate of the high priest was worn upon the ephod in front.'),
(25617, 'Ephors', 'pl. ', 'of Ephor'),
(25618, 'Ephori', 'pl. ', 'of Ephor'),
(25619, 'Ephor', 'n.', 'A magistrate; one of a body of five magistrates chosen by\n   the people of ancient Sparta. They exercised control even over the\n   king.'),
(25620, 'Ephoral', 'a.', 'Pertaining to an ephor.'),
(25621, 'Ephraim', 'n.', 'A hunter\'s name for the grizzly bear.'),
(25622, 'Ephyra', 'n.', 'A stage in the development of discophorous medusae, when\n   they first begin to swim about after being detached from the strobila.\n   See Strobila.'),
(25623, 'Epiblast', 'n.', 'The outer layer of the blastoderm; the ectoderm. See\n   Blastoderm, Delamination.'),
(25624, 'Epiblema', 'n.', 'The epidermal cells of rootlets, specially adapted to\n   absorb liquids.'),
(25625, 'Epibolic', 'a.', 'Growing or covering over; -- said of a kind of\n   invagination. See under Invagination.'),
(25626, 'Epiboly', 'n.', 'Epibolic invagination. See under Invagination.'),
(25627, 'Epical', 'a.', 'Epic.'),
(25628, 'Epicarp', '', 'The external or outermost layer of a fructified or ripened\n   ovary. See Illust. under Endocarp.'),
(25629, 'Epicede', 'n.', 'A funeral song or discourse; an elegy.'),
(25630, 'Epicene', 'a. & n.', 'Common to both sexes; -- a term applied, in grammar,\n   to such nouns as have but one form of gender, either the masculine or\n   feminine, to indicate animals of both sexes; as boy^s, bos, for the ox\n   and cow; sometimes applied to eunuchs and hermaphrodites.'),
(25631, 'Epicene', 'a. & n.', 'Fig.: Sexless; neither one thing nor the other.'),
(25632, 'Epicoele', 'n.', 'A cavity formed by the invagination of the outer wall of\n   the body, as the atrium of an amphioxus and possibly the body cavity of\n   vertebrates.'),
(25633, 'Epicoene', 'a.', 'Epicene.'),
(25634, 'Epicolic', 'a.', 'Situated upon or over the colon; -- applied to the region\n   of the abdomen adjacent to the colon.'),
(25635, 'Epicure', 'n.', 'A follower of Epicurus; an Epicurean.'),
(25636, 'Epicure', 'n.', 'One devoted to dainty or luxurious sensual enjoyments,\n   esp. to the luxuries of the table.'),
(25637, 'Epicycle', 'n.', 'A circle, whose center moves round in the circumference\n   of a greater circle; or a small circle, whose center, being fixed in\n   the deferent of a planet, is carried along with the deferent, and yet,\n   by its own peculiar motion, carries the body of the planet fastened to\n   it round its proper center.'),
(25638, 'Epicycle', 'n.', 'A circle which rolls on the circumference of another\n   circle, either externally or internally.'),
(25639, 'Epidemic', 'a.', 'Alt. of Epidemical'),
(25640, 'Epidemic', 'n.', 'An epidemic disease.'),
(25641, 'Epidemic', 'n.', 'Anything which takes possession of the minds of people as\n   an epidemic does of their bodies; as, an epidemic of terror.'),
(25642, 'Epidemy', 'n.', 'An epidemic disease.'),
(25643, 'Epiderm', 'n.', 'The epidermis.'),
(25644, 'Epidote', 'n.', 'A mineral, commonly of a yellowish green (pistachio)\n   color, occurring granular, massive, columnar, and in monoclinic\n   crystals. It is a silicate of alumina, lime, and oxide of iron, or\n   manganese.'),
(25645, 'Epidotic', 'a.', 'Related to, resembling, or containing epidote; as, an\n   epidotic granite.'),
(25646, 'Epigaea', 'n.', 'An American genus of plants, containing but a single\n   species (E. repens), the trailing arbutus.'),
(25647, 'Epigeal', 'a.', 'Epigaeous.'),
(25648, 'Epigee', 'n.', 'See Perigee.'),
(25649, 'Epigene', 'a.', 'Foreign; unnatural; unusual; -- said of forms of crystals\n   not natural to the substances in which they are found.'),
(25650, 'Epigene', 'a.', 'Formed originating on the surface of the earth; -- opposed\n   to hypogene; as, epigene rocks.'),
(25651, 'Epigeous', 'a.', 'Same as Epigaeous.'),
(25652, 'Epigeum', 'n.', 'See Perigee.'),
(25653, 'Epigram', 'n.', 'A short poem treating concisely and pointedly of a single\n   thought or event. The modern epigram is so contrived as to surprise the\n   reader with a witticism or ingenious turn of thought, and is often\n   satirical in character.'),
(25654, 'Epigram', 'n.', 'An effusion of wit; a bright thought tersely and sharply\n   expressed, whether in verse or prose.'),
(25655, 'Epigram', 'n.', 'The style of the epigram.'),
(25656, 'Epigraph', 'n.', 'Any inscription set upon a building; especially, one\n   which has to do with the building itself, its founding or dedication.'),
(25657, 'Epigraph', 'n.', 'A citation from some author, or a sentence framed for the\n   purpose, placed at the beginning of a work or of its separate\n   divisions; a motto.'),
(25658, 'Epihyal', 'n.', 'A segment next above the ceratohyal in the hyoidean arch.'),
(25659, 'Epilepsy', 'n.', 'The \"falling sickness,\" so called because the patient\n   falls suddenly to the ground; a disease characterized by paroxysms (or\n   fits) occurring at interval and attended by sudden loss of\n   consciousness, and convulsive motions of the muscles.'),
(25660, 'Epilogic', 'a.', 'Alt. of Epilogical'),
(25661, 'Epilogue', 'n.', 'A speech or short poem addressed to the spectators and\n   recited by one of the actors, after the conclusion of the play.'),
(25662, 'Epilogue', 'n.', 'The closing part of a discourse, in which the principal\n   matters are recapitulated; a conclusion.'),
(25663, 'Epimera', 'n. pl.', 'See Epimeron.'),
(25664, 'Epimeral', 'a.', 'Pertaining to the epimera.'),
(25665, 'Epimere', 'n.', 'One of the segments of the transverse axis, or the so\n   called homonymous parts; as, for example, one of the several segments\n   of the extremities in vertebrates, or one of the similar segments in\n   plants, such as the segments of a segmented leaf.'),
(25666, 'Epimera', 'pl. ', 'of Epimeron'),
(25667, 'Epimeron', 'n.', 'In crustaceans: The part of the side of a somite external\n   to the basal joint of each appendage.'),
(25668, 'Epimeron', 'n.', 'In insects: The lateral piece behind the episternum.'),
(25669, 'Epiornis', 'n.', 'One of the gigantic ostrichlike birds of the genus\n   Aepiornis, only recently extinct. Its remains have been found in\n   Madagascar.'),
(25670, 'Epiotic', 'n.', 'The upper and outer element of periotic bone, -- in man\n   forming a part of the temporal bone.'),
(25671, 'Epiphany', 'n.', 'An appearance, or a becoming manifest.'),
(25672, 'Epiphany', 'n.', 'A church festival celebrated on the 6th of January, the\n   twelfth day after Christmas, in commemoration of the visit of the Magi\n   of the East to Bethlehem, to see and worship the child Jesus; or, as\n   others maintain, to commemorate the appearance of the star to the Magi,\n   symbolizing the manifestation of Christ to the Gentles; Twelfthtide.'),
(25673, 'Epiphora', 'n.', 'The watery eye; a disease in which the tears accumulate\n   in the eye, and trickle over the cheek.'),
(25674, 'Epiphora', 'n.', 'The emphatic repetition of a word or phrase, at the end\n   of several sentences or stanzas.'),
(25675, 'Epiphyte', 'n.', 'An air plant which grows on other plants, but does not\n   derive its nourishment from them. See Air plant.'),
(25676, 'Epiphyte', 'n.', 'A vegetable parasite growing on the surface of the body.'),
(25677, 'Epiploce', 'n.', 'A figure by which one striking circumstance is added, in\n   due gradation, to another; climax; e. g., \"He not only spared his\n   enemies, but continued them in employment; not only continued, but\n   advanced them.\"'),
(25678, 'Epiploic', 'a.', 'Relating to the epiploon.'),
(25679, 'Epiploa', 'pl. ', 'of Epiploon'),
(25680, 'Epiploon', 'n.', 'See Omentum.'),
(25681, 'Epipodia', 'pl. ', 'of Epipodium'),
(25682, 'Epipolic', 'a.', 'Producing, or relating to, epipolism or fluorescence.'),
(25683, 'Epipubic', 'a.', 'Relating to the epipubis.'),
(25684, 'Epipubes', 'pl. ', 'of Epipubis'),
(25685, 'Epipubis', 'n.', 'A cartilage or bone in front of the pubis in some\n   amphibians and other animals.'),
(25686, 'Episcopy', 'n.', 'Survey; superintendence.'),
(25687, 'Episcopy', 'n.', 'Episcopacy.'),
(25688, 'Episodal', 'a.', 'Same as Episodic.'),
(25689, 'Episodic', 'a.', 'Alt. of Episodical'),
(25690, 'Episperm', 'n.', 'The skin or coat of a seed, especially the outer coat.\n   See Testa.'),
(25691, 'Epispore', 'n.', 'The thickish outer coat of certain spores.'),
(25692, 'Epistle', 'n.', 'A writing directed or sent to a person or persons; a\n   written communication; a letter; -- applied usually to formal,\n   didactic, or elegant letters.'),
(25693, 'Epistle', 'n.', 'One of the letters in the New Testament which were\n   addressed to their Christian brethren by Apostles.'),
(25694, 'Epistle', 'v. t.', 'To write; to communicate in a letter or by writing.'),
(25695, 'Epistler', 'n.', 'A writer of epistles, or of an epistle of the New\n   Testament.'),
(25696, 'Epistler', 'n.', 'The ecclesiastic who reads the epistle at the communion\n   service.'),
(25697, 'Epistoma', 'n.', 'Alt. of Epistome'),
(25698, 'Epistome', 'n.', 'The region between the antennae and the mouth, in\n   Crustacea.'),
(25699, 'Epistome', 'n.', 'A liplike organ that covers the mouth, in most Bryozoa.\n   See Illust., under Entoprocta.'),
(25700, 'Epistyle', 'n.', 'A massive piece of stone or wood laid immediately on the\n   abacus of the capital of a column or pillar; -- now called architrave.'),
(25701, 'Epitaph', 'n.', 'An inscription on, or at, a tomb, or a grave, in memory or\n   commendation of the one buried there; a sepulchral inscription.'),
(25702, 'Epitaph', 'n.', 'A brief writing formed as if to be inscribed on a\n   monument, as that concerning Alexander: \"Sufficit huic tumulus, cui non\n   sufficeret orbis.\"'),
(25703, 'Epitaph', 'v. t.', 'To commemorate by an epitaph.'),
(25704, 'Epitaph', 'v. i.', 'To write or speak after the manner of an epitaph.'),
(25705, 'Epitasis', 'n.', 'That part which embraces the main action of a play, poem,\n   and the like, and leads on to the catastrophe; -- opposed to protasis.'),
(25706, 'Epitasis', 'n.', 'The period of violence in a fever or disease; paroxysm.'),
(25707, 'Epitheca', 'n.', 'A continuous and, usually, structureless layer which\n   covers more or less of the exterior of many corals.'),
(25708, 'Epithem', 'n.', 'Any external topical application to the body, except\n   ointments and plasters, as a poultice, lotion, etc.'),
(25709, 'Epithema', 'n.', 'A horny excrescence upon the beak of birds.'),
(25710, 'Epithet', 'n.', 'An adjective expressing some quality, attribute, or\n   relation, that is properly or specially appropriate to a person or\n   thing; as, a just man; a verdant lawn.'),
(25711, 'Epithet', 'n.', 'Term; expression; phrase.'),
(25712, 'Epithet', 'v. t.', 'To describe by an epithet.'),
(25713, 'Epithite', 'n.', 'A lazy, worthless fellow; a vagrant.'),
(25714, 'Epitomes', 'pl. ', 'of Epitome'),
(25715, 'Epitome', 'n.', 'A work in which the contents of a former work are reduced\n   within a smaller space by curtailment and condensation; a brief\n   summary; an abridgement.'),
(25716, 'Epitome', 'n.', 'A compact or condensed representation of anything.'),
(25717, 'Epitrite', 'n.', 'A foot consisting of three long syllables and one short\n   syllable.'),
(25718, 'Epitrope', 'n.', 'A figure by which permission is either seriously or\n   ironically granted to some one, to do what he proposes to do; e. g.,\n   \"He that is unjust, let him be unjust still.\"'),
(25719, 'Epozoan', 'n.', 'An epizoon.'),
(25720, 'Epozoic', 'a.', 'Living upon the exterior of another animal; ectozoic; --\n   said of external parasites.'),
(25721, 'Epizoa', 'pl. ', 'of Epizoon'),
(25722, 'Epizoon', 'n.', 'One of the artificial group of invertebrates of various\n   kinds, which live parasitically upon the exterior of other animals; an\n   ectozoon. Among them are the lice, ticks, many acari, the lerneans, or\n   fish lice, and other crustaceans.'),
(25723, 'Epizooty', 'n.', 'Alt. of Epizootic'),
(25724, 'Epoch', 'n.', 'A fixed point of time, established in history by the\n   occurrence of some grand or remarkable event; a point of time marked by\n   an event of great subsequent influence; as, the epoch of the creation;\n   the birth of Christ was the epoch which gave rise to the Christian era.'),
(25725, 'Epoch', 'n.', 'A period of time, longer or shorter, remarkable for events\n   of great subsequent influence; a memorable period; as, the epoch of\n   maritime discovery, or of the Reformation.'),
(25726, 'Epoch', 'n.', 'A division of time characterized by the prevalence of\n   similar conditions of the earth; commonly a minor division or part of a\n   period.'),
(25727, 'Epoch', 'n.', 'The date at which a planet or comet has a longitude or\n   position.'),
(25728, 'Epoch', 'n.', 'An arbitrary fixed date, for which the elements used in\n   computing the place of a planet, or other heavenly body, at any other\n   date, are given; as, the epoch of Mars; lunar elements for the epoch\n   March 1st, 1860.'),
(25729, 'Epocha', 'n.', 'See Epoch.'),
(25730, 'Epochal', 'a.', 'Belonging to an epoch; of the nature of an epoch.'),
(25731, 'Epode', 'n.', 'The after song; the part of a lyric ode which follows the\n   strophe and antistrophe, -- the ancient ode being divided into strophe,\n   antistrophe, and epode.'),
(25732, 'Epode', 'n.', 'A species of lyric poem, invented by Archilochus, in which a\n   longer verse is followed by a shorter one; as, the Epodes of Horace. It\n   does not include the elegiac distich.'),
(25733, 'Epodic', 'a.', 'Pertaining to, or resembling, an epode.'),
(25734, 'Eponym', 'n.', 'Alt. of Eponyme'),
(25735, 'Eponyme', 'n.', 'The hypothetical individual who is assumed as the person\n   from whom any race, city, etc., took its name; as, Hellen is an eponym\n   of the Hellenes.'),
(25736, 'Eponyme', 'n.', 'A name, as of a people, country, and the like, derived\n   from that of an individual.'),
(25737, 'Eponymic', 'a.', 'Same as Eponymous.'),
(25738, 'Eponymy', 'n.', 'The derivation of the name of a race, tribe, etc., from\n   that of a fabulous hero, progenitor, etc.'),
(25739, 'Epopee', 'n.', 'Alt. of Epopoeia'),
(25740, 'Epopoeia', 'n.', 'An epic poem; epic poetry.'),
(25741, 'Epopt', 'n.', 'One instructed in the mysteries of a secret system.'),
(25742, 'Epsomite', 'n.', 'Native sulphate of magnesia or Epsom salt.'),
(25743, 'Epulary', 'a.', 'Of or pertaining to a feast or banquet.'),
(25744, 'Epulis', 'n.', 'A hard tumor developed from the gums.'),
(25745, 'Epulose', 'a.', 'Feasting to excess.'),
(25746, 'Epulotic', 'a.', 'Promoting the skinning over or healing of sores; as, an\n   epulotic ointment.'),
(25747, 'Epulotic', 'n.', 'An epulotic agent.'),
(25748, 'Epure', 'n.', 'A draught or model from which to build; especially, one of\n   the full size of the work to be done; a detailed drawing.'),
(25749, 'Equable', 'a.', 'Equal and uniform; continuing the same at different times;\n   -- said of motion, and the like; uniform in surface; smooth; as, an\n   equable plain or globe.'),
(25750, 'Equable', 'a.', 'Uniform in action or intensity; not variable or changing;\n   -- said of the feelings or temper.'),
(25751, 'Equably', 'adv.', 'In an equable manner.'),
(25752, 'Equal', 'a.', 'Agreeing in quantity, size, quality, degree, value, etc.;\n   having the same magnitude, the same value, the same degree, etc.; --\n   applied to number, degree, quantity, and intensity, and to any subject\n   which admits of them; neither inferior nor superior, greater nor less,\n   better nor worse; corresponding; alike; as, equal quantities of land,\n   water, etc. ; houses of equal size; persons of equal stature or\n   talents; commodities of equal value.'),
(25753, 'Equal', 'a.', 'Bearing a suitable relation; of just proportion; having\n   competent power, abilities, or means; adequate; as, he is not equal to\n   the task.'),
(25754, 'Equal', 'a.', 'Not variable; equable; uniform; even; as, an equal movement.'),
(25755, 'Equal', 'a.', 'Evenly balanced; not unduly inclining to either side;\n   characterized by fairness; unbiased; impartial; equitable; just.'),
(25756, 'Equal', 'a.', 'Of the same interest or concern; indifferent.'),
(25757, 'Equal', 'a.', 'Intended for voices of one kind only, either all male or all\n   female; -- opposed to mixed.'),
(25758, 'Equal', 'a.', 'Exactly agreeing with respect to quantity.'),
(25759, 'Equal', 'n.', 'One not inferior or superior to another; one having the same\n   or a similar age, rank, station, office, talents, strength, or other\n   quality or condition; an equal quantity or number; as, \"If equals be\n   taken from equals the remainders are equal.\"'),
(25760, 'Equal', 'n.', 'State of being equal; equality.'),
(25761, 'Equaled', 'imp. & p. p.', 'of Equal'),
(25762, 'Equalled', '', 'of Equal'),
(25763, 'Equaling', 'p. pr. & vb. n.', 'of Equal'),
(25764, 'Equal', 'v. t.', 'To be or become equal to; to have the same quantity, the\n   same value, the same degree or rank, or the like, with; to be\n   commen/urate with.'),
(25765, 'Equal', 'v. t.', 'To make equal return to; to recompense fully.'),
(25766, 'Equal', 'v. t.', 'To make equal or equal to; to equalize; hence, to compare\n   or regard as equals; to put on equality.'),
(25767, 'Equality', 'n.', 'The condition or quality of being equal; agreement in\n   quantity or degree as compared; likeness in bulk, value, rank,\n   properties, etc.; as, the equality of two bodies in length or\n   thickness; an equality of rights.'),
(25768, 'Equality', 'n.', 'Sameness in state or continued course; evenness;\n   uniformity; as, an equality of temper or constitution.'),
(25769, 'Equality', 'n.', 'Evenness; uniformity; as, an equality of surface.'),
(25770, 'Equality', 'n.', 'Exact agreement between two expressions or magnitudes\n   with respect to quantity; -- denoted by the symbol =; thus, a = x\n   signifies that a contains the same number and kind of units of measure\n   that x does.'),
(25771, 'Equalize', 'v. t.', 'To make equal; to cause to correspond, or be like, in\n   amount or degree as compared; as, to equalize accounts, burdens, or\n   taxes.'),
(25772, 'Equalize', 'v. t.', 'To pronounce equal; to compare as equal.'),
(25773, 'Equalize', 'v. t.', 'To be equal to; equal; to match.'),
(25774, 'Equally', 'adv.', 'In an equal manner or degree in equal shares or\n   proportion; with equal and impartial justice; without difference;\n   alike; evenly; justly; as, equally taxed, furnished, etc.'),
(25775, 'Equant', 'n.', 'A circle around whose circumference a planet or the center\n   of ann epicycle was conceived to move uniformly; -- called also\n   eccentric equator.'),
(25776, 'Equated', 'imp. & p. p.', 'of Equate'),
(25777, 'Equating', 'p. pr. & vb. n.', 'of Equate'),
(25778, 'Equate', 'v. t.', 'To make equal; to reduce to an average; to make such an\n   allowance or correction in as will reduce to a common standard of\n   comparison; to reduce to mean time or motion; as, to equate payments;\n   to equate lines of railroad for grades or curves; equated distances.'),
(25779, 'Equation', 'n.', 'A making equal; equal division; equality; equilibrium.'),
(25780, 'Equation', 'n.', 'An expression of the condition of equality between two\n   algebraic quantities or sets of quantities, the sign = being placed\n   between them; as, a binomial equation; a quadratic equation; an\n   algebraic equation; a transcendental equation; an exponential equation;\n   a logarithmic equation; a differential equation, etc.'),
(25781, 'Equation', 'n.', 'A quantity to be applied in computing the mean place or\n   other element of a celestial body; that is, any one of the several\n   quantities to be added to, or taken from, its position as calculated on\n   the hypothesis of a mean uniform motion, in order to find its true\n   position as resulting from its actual and unequal motion.'),
(25782, 'Equator', 'n.', 'The imaginary great circle on the earth\'s surface,\n   everywhere equally distant from the two poles, and dividing the earth\'s\n   surface into two hemispheres.'),
(25783, 'Equator', 'n.', 'The great circle of the celestial sphere, coincident with\n   the plane of the earth\'s equator; -- so called because when the sun is\n   in it, the days and nights are of equal length; hence called also the\n   equinoctial, and on maps, globes, etc., the equinoctial line.'),
(25784, 'Equerry', 'n.', 'A large stable or lodge for horses.'),
(25785, 'Equerry', 'n.', 'An officer of princes or nobles, charged with the care of\n   their horses.'),
(25786, 'Equery', 'n.', 'Same as Equerry.'),
(25787, 'Equi-', '', 'A prefix, meaning equally; as, equidistant; equiangular.'),
(25788, 'Equiform', 'a.', 'Having the same form; uniform.'),
(25789, 'Equinal', 'a.', 'See Equine.'),
(25790, 'Equine', 'a.', 'Of, pertaining to, or resembling, a horse.'),
(25791, 'Equinia', 'n.', 'Glanders.'),
(25792, 'Equinox', 'n.', 'The time when the sun enters one of the equinoctial\n   points, that is, about March 21 and September 22. See Autumnal equinox,\n   Vernal equinox, under Autumnal and Vernal.'),
(25793, 'Equinox', 'n.', 'Equinoctial wind or storm.'),
(25794, 'Equipped', 'imp. & p. p.', 'of Equip'),
(25795, 'Equip', 'v. t.', 'To furnish for service, or against a need or exigency; to\n   fit out; to supply with whatever is necessary to efficient action in\n   any way; to provide with arms or an armament, stores, munitions,\n   rigging, etc.; -- said esp. of ships and of troops.'),
(25796, 'Equip', 'v. t.', 'To dress up; to array; accouter.'),
(25797, 'Equipage', 'n.', 'Furniture or outfit, whether useful or ornamental;\n   especially, the furniture and supplies of a vessel, fitting her for a\n   voyage or for warlike purposes, or the furniture and necessaries of an\n   army, a body of troops, or a single soldier, including whatever is\n   necessary for efficient service; equipments; accouterments;\n   habiliments; attire.'),
(25798, 'Equipage', 'n.', 'Retinue; train; suite.'),
(25799, 'Equipage', 'n.', 'A carriage of state or of pleasure with all that\n   accompanies it, as horses, liveried servants, etc., a showy turn-out.'),
(25800, 'Equiseta', 'pl. ', 'of Equisetum'),
(25801, 'Equitant', 'a.', 'Mounted on, or sitting upon, a horse; riding on\n   horseback.'),
(25802, 'Equitant', 'a.', 'Overlapping each other; -- said of leaves whose bases are\n   folded so as to overlap and bestride the leaves within or above them,\n   as in the iris.'),
(25803, 'Equites', 'n. pl', 'An order of knights holding a middle place between the\n   senate and the commonalty; members of the Roman equestrian order.'),
(25804, 'Equities', 'pl. ', 'of Equity'),
(25805, 'Equity', 'n.', 'Equality of rights; natural justice or right; the giving,\n   or desiring to give, to each man his due, according to reason, and the\n   law of God to man; fairness in determination of conflicting claims;\n   impartiality.'),
(25806, 'Equity', 'n.', 'An equitable claim; an equity of redemption; as, an equity\n   to a settlement, or wife\'s equity, etc.'),
(25807, 'Equity', 'n.', 'A system of jurisprudence, supplemental to law, properly so\n   called, and complemental of it.'),
(25808, 'Equivoke', 'n.', 'An ambiguous term; a word susceptible of different\n   significations.'),
(25809, 'Equivoke', 'n.', 'An equivocation; a guibble.'),
(25810, 'Equus', 'n.', 'A genus of mammals, including the horse, ass, etc.'),
(25811, 'Eradiate', 'v. i.', 'To shoot forth, as rays of light; to beam; to radiate.'),
(25812, 'Erasable', 'a.', 'Capable of being erased.'),
(25813, 'Erased', 'imp. & p. p.', 'of Erase'),
(25814, 'Erasing', 'p. pr. & vb. n.', 'of Erase'),
(25815, 'Erase', 'v. t.', 'To rub or scrape out, as letters or characters written,\n   engraved, or painted; to efface; to expunge; to cross out; as, to erase\n   a word or a name.'),
(25816, 'Erase', 'v. t.', 'Fig.: To obliterate; to expunge; to blot out; -- used of\n   ideas in the mind or memory.'),
(25817, 'Erased', 'p. pr. & a.', 'Rubbed or scraped out; effaced; obliterated.'),
(25818, 'Erased', 'p. pr. & a.', 'Represented with jagged and uneven edges, as is\n   torn off; -- used esp. of the head or limb of a beast. Cf. Couped.'),
(25819, 'Eraser', 'n.', 'One who, or that which, erases; esp., a sharp instrument or\n   a piece of rubber used to erase writings, drawings, etc.'),
(25820, 'Erasion', 'n.', 'The act of erasing; a rubbing out; obliteration.'),
(25821, 'Erastian', 'n.', 'One of the followers of Thomas Erastus, a German\n   physician and theologian of the 16th century. He held that the\n   punishment of all offenses should be referred to the civil power, and\n   that holy communion was open to all. In the present day, an Erastian is\n   one who would see the church placed entirely under the control of the\n   State.'),
(25822, 'Erasure', 'n.', 'The act of erasing; a scratching out; obliteration.'),
(25823, 'Erative', 'a.', 'Pertaining to the Muse Erato who presided over amatory\n   poetry.'),
(25824, 'Erato', 'n.', 'The Muse who presided over lyric and amatory poetry.'),
(25825, 'Erbium', 'n.', 'A rare metallic element associated with several other rare\n   elements in the mineral gadolinite from Ytterby in Sweden. Symbol Er.\n   Atomic weight 165.9. Its salts are rose-colored and give characteristic\n   spectra. Its sesquioxide is called erbia.'),
(25826, 'Erebus', 'n.', 'A place of nether darkness, being the gloomy space through\n   which the souls passed to Hades. See Milton\'s \"Paradise Lost,\" Book\n   II., line 883.'),
(25827, 'Erebus', 'n.', 'The son of Chaos and brother of Nox, who dwelt in Erebus.'),
(25828, 'Erect', 'a.', 'Upright, or having a vertical position; not inverted; not\n   leaning or bent; not prone; as, to stand erect.'),
(25829, 'Erect', 'a.', 'Directed upward; raised; uplifted.'),
(25830, 'Erect', 'a.', 'Bold; confident; free from depression; undismayed.'),
(25831, 'Erect', 'a.', 'Watchful; alert.'),
(25832, 'Erect', 'a.', 'Standing upright, with reference to the earth\'s surface, or\n   to the surface to which it is attached.'),
(25833, 'Erect', 'a.', 'Elevated, as the tips of wings, heads of serpents, etc.'),
(25834, 'Erected', 'imp. & p. p.', 'of Erect'),
(25835, 'Erecting', 'p. pr. & vb. n.', 'of Erect'),
(25836, 'Erect', 'v. t.', 'To raise and place in an upright or perpendicular\n   position; to set upright; to raise; as, to erect a pole, a flagstaff, a\n   monument, etc.'),
(25837, 'Erect', 'v. t.', 'To raise, as a building; to build; to construct; as, to\n   erect a house or a fort; to set up; to put together the component parts\n   of, as of a machine.'),
(25838, 'Erect', 'v. t.', 'To lift up; to elevate; to exalt; to magnify.'),
(25839, 'Erect', 'v. t.', 'To animate; to encourage; to cheer.'),
(25840, 'Erect', 'v. t.', 'To set up as an assertion or consequence from premises,\n   or the like.'),
(25841, 'Erect', 'v. t.', 'To set up or establish; to found; to form; to institute.'),
(25842, 'Erect', 'v. i.', 'To rise upright.'),
(25843, 'Erecter', 'n.', 'An erector; one who raises or builds.'),
(25844, 'Erectile', 'a.', 'Capable of being erected; susceptible of being erected of\n   dilated.'),
(25845, 'Erection', 'n.', 'The act of erecting, or raising upright; the act of\n   constructing, as a building or a wall, or of fitting together the parts\n   of, as a machine; the act of founding or establishing, as a\n   commonwealth or an office; also, the act of rousing to excitement or\n   courage.'),
(25846, 'Erection', 'n.', 'The state of being erected, lifted up, built,\n   established, or founded; exaltation of feelings or purposes.'),
(25847, 'Erection', 'n.', 'State of being stretched to stiffness; tension.'),
(25848, 'Erection', 'n.', 'Anything erected; a building of any kind.'),
(25849, 'Erection', 'n.', 'The state of a part which, from having been soft, has\n   become hard and swollen by the accumulation of blood in the erectile\n   tissue.'),
(25850, 'Erective', 'a.', 'Making erect or upright; raising; tending to erect.'),
(25851, 'Erectly', 'adv.', 'In an erect manner or posture.'),
(25852, 'Erector', 'n.', 'One who, or that which, erects.'),
(25853, 'Erector', 'n.', 'A muscle which raises any part.'),
(25854, 'Erector', 'n.', 'An attachment to a microscope, telescope, or other optical\n   instrument, for making the image erect instead of inverted.'),
(25855, 'Erelong', 'adv.', 'Before the /apse of a long time; soon; -- usually\n   separated, ere long.'),
(25856, 'Eremite', 'n.', 'A hermit.'),
(25857, 'Eremitic', 'a.', 'Alt. of Eremitical'),
(25858, 'Ereption', 'n.', 'A snatching away.'),
(25859, 'Erethism', 'n.', 'A morbid degree of excitement or irritation in an organ.'),
(25860, 'Erewhile', 'adv.', 'Alt. of Erewhiles'),
(25861, 'Erven', 'pl. ', 'of Erf'),
(25862, 'Ergat', 'v. t.', 'To deduce logically, as conclusions.'),
(25863, 'Ergot', 'n.', 'A diseased condition of rye and other cereals, in which the\n   grains become black, and often spur-shaped. It is caused by a parasitic\n   fungus, Claviceps purpurea.'),
(25864, 'Ergot', 'n.', 'The mycelium or spawn of this fungus infecting grains of rye\n   and wheat. It is a powerful remedial agent, and also a dangerous\n   poison, and is used as a means of hastening childbirth, and to arrest\n   bleeding.'),
(25865, 'Ergot', 'n.', 'A stub, like soft horn, about the size of a chestnut,\n   situated behind and below the pastern joint.'),
(25866, 'Ergot', 'n.', 'See 2d Calcar, 3 (b).'),
(25867, 'Ergotic', 'a.', 'Pertaining to, or derived from, ergot; as, ergotic acid.'),
(25868, 'Ergotin', 'n.', 'An extract made from ergot.'),
(25869, 'Ergotine', '', 'A powerful astringent alkaloid extracted from ergot as a\n   brown, amorphous, bitter substance. It is used to produce contraction\n   of the uterus.'),
(25870, 'Ergotism', 'n.', 'A logical deduction.'),
(25871, 'Ergotism', 'n.', 'A diseased condition produced by eating rye affected with\n   the ergot fungus.'),
(25872, 'Eriach', 'n.', 'Alt. of Eric'),
(25873, 'Erica', 'n.', 'A genus of shrubby plants, including the heaths, many of\n   them producing beautiful flowers.'),
(25874, 'Ericinol', 'n.', 'A colorless oil (quickly becoming brown), with a pleasant\n   odor, obtained by the decomposition of ericolin.'),
(25875, 'Ericius', 'n.', 'The Vulgate rendering of the Hebrew word qip/d, which in\n   the \"Authorized Version\" is translated bittern, and in the Revised\n   Version, porcupine.'),
(25876, 'Ericolin', 'n.', 'A glucoside found in the bearberry (and others of the\n   Ericaceae), and extracted as a bitter, yellow, amorphous mass.'),
(25877, 'Eridanus', 'n.', 'A long, winding constellation extending southward from\n   Taurus and containing the bright star Achernar.'),
(25878, 'Erigible', 'a.', 'Capable of being erected.'),
(25879, 'Eringo', 'n.', 'The sea holly. See Eryngo.'),
(25880, 'Erinite', 'n.', 'A hydrous arseniate of copper, of an emerald-green color;\n   -- so called from Erin, or Ireland, where it occurs.'),
(25881, 'Erinyes', 'pl. ', 'of Erinys'),
(25882, 'Erinys', 'n.', 'An avenging deity; one of the Furies; sometimes, conscience\n   personified.'),
(25883, 'Eristic', 'a.', 'Alt. of Eristical'),
(25884, 'Erlking', 'n.', 'A personification, in German and Scandinavian mythology,\n   of a spirit natural power supposed to work mischief and ruin, esp. to\n   children.'),
(25885, 'Ermelin', 'n.', 'Alt. of Ermilin'),
(25886, 'Ermilin', 'n.', 'See Ermine.'),
(25887, 'Ermin', 'n.', 'An Armenian.'),
(25888, 'Ermine', 'n.', 'A valuable fur-bearing animal of the genus Mustela (M.\n   erminea), allied to the weasel; the stoat. It is found in the northern\n   parts of Asia, Europe, and America. In summer it is brown, but in\n   winter it becomes white, except the tip of the tail, which is always\n   black.'),
(25889, 'Ermine', 'n.', 'The fur of the ermine, as prepared for ornamenting garments\n   of royalty, etc., by having the tips of the tails, which are black,\n   arranged at regular intervals throughout the white.'),
(25890, 'Ermine', 'n.', 'By metonymy, the office or functions of a judge, whose\n   state robe, lined with ermine, is emblematical of purity and honor\n   without stain.'),
(25891, 'Ermine', 'n.', 'One of the furs. See Fur (Her.)'),
(25892, 'Ermine', 'v. t.', 'To clothe with, or as with, ermine.'),
(25893, 'Ermined', 'a.', 'Clothed or adorned with the fur of the ermine.'),
(25894, 'Ermines', 'n.', 'Alt. of Erminois'),
(25895, 'Erminois', 'n.', 'See Note under Ermine, n., 4.'),
(25896, 'Ermit', 'n.', 'A hermit.'),
(25897, 'Ernest', 'n.', 'See Earnest.'),
(25898, 'Eroded', 'imp. & p. p.', 'of Erode'),
(25899, 'Eroding', 'p. pr. & vb. n.', 'of Erode'),
(25900, 'Erode', 'v. t.', 'To eat into or away; to corrode; as, canker erodes the\n   flesh.'),
(25901, 'Eroded', 'p. p. & a.', 'Eaten away; gnawed; irregular, as if eaten or worn\n   away.'),
(25902, 'Eroded', 'p. p. & a.', 'Having the edge worn away so as to be jagged or\n   irregularly toothed.'),
(25903, 'Erodent', 'n.', 'A medicine which eats away extraneous growths; a caustic.'),
(25904, 'Erogated', 'imp. & p. p.', 'of Erogate'),
(25905, 'Erogate', 'v. t.', 'To lay out, as money; to deal out; to expend.'),
(25906, 'Erose', 'a.', 'Irregular or uneven as if eaten or worn away.'),
(25907, 'Erose', 'a.', 'Jagged or irregularly toothed, as if nibbled out or gnawed.'),
(25908, 'Erosion', 'n.', 'The act or operation of eroding or eating away.'),
(25909, 'Erosion', 'n.', 'The state of being eaten away; corrosion; canker.'),
(25910, 'Erosive', 'a.', 'That erodes or gradually eats away; tending to erode;\n   corrosive.'),
(25911, 'Eroteme', 'n.', 'A mark indicating a question; a note of interrogation.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(25912, 'Erotesis', 'n.', 'A figure o/ speech by which a strong affirmation of the\n   contrary, is implied under the form o/ an earnest interrogation, as in\n   the following lines; -'),
(25913, 'Erotic', 'a.', 'Alt. of Erotical'),
(25914, 'Erotical', 'a.', 'Of or pertaining to the passion of love; treating of\n   love; amatory.'),
(25915, 'Erotic', 'n.', 'An amorous composition or poem.'),
(25916, 'Erred', 'imp. & p. p.', 'of Err'),
(25917, 'Erring', 'p. pr. & vb. n.', 'of Err'),
(25918, 'Errable', 'a.', 'Liable to error; fallible.'),
(25919, 'Errabund', 'a.', 'Erratic.'),
(25920, 'Errancy', 'n.', 'A wandering; state of being in error.'),
(25921, 'Errand', 'n.', 'A special business intrusted to a messenger; something to\n   be told or done by one sent somewhere for the purpose; often, a verbal\n   message; a commission; as, the servant was sent on an errand; to do an\n   errand. Also, one\'s purpose in going anywhere.'),
(25922, 'Errant', 'a.', 'Wandering; deviating from an appointed course, or from a\n   direct path; roving.'),
(25923, 'Errant', 'a.', 'Notorious; notoriously bad; downright; arrant.'),
(25924, 'Errant', 'a.', 'Journeying; itinerant; -- formerly applied to judges who\n   went on circuit and to bailiffs at large.'),
(25925, 'Errant', 'n.', 'One who wanders about.'),
(25926, 'Errantia', 'n. pl.', 'A group of chaetopod annelids, including those that\n   are not confined to tubes. See Chaetopoda.'),
(25927, 'Errantry', 'n.', 'A wandering; a roving; esp., a roving in quest of\n   adventures.'),
(25928, 'Errantry', 'n.', 'The employment of a knight-errant.'),
(25929, 'Errata', 'n. pl.', 'See Erratum.'),
(25930, 'Erratic', 'a.', 'Having no certain course; roving about without a fixed\n   destination; wandering; moving; -- hence, applied to the planets as\n   distinguished from the fixed stars.'),
(25931, 'Erratic', 'a.', 'Deviating from a wise of the common course in opinion or\n   conduct; eccentric; strange; queer; as, erratic conduct.'),
(25932, 'Erratic', 'a.', 'Irregular; changeable.'),
(25933, 'Erratic', 'n.', 'One who deviates from common and accepted opinions; one\n   who is eccentric or preserve in his intellectual character.'),
(25934, 'Erratic', 'n.', 'A rogue.'),
(25935, 'Erratic', 'n.', 'Any stone or material that has been borne away from its\n   original site by natural agencies; esp., a large block or fragment of\n   rock; a bowlder.'),
(25936, 'Erration', 'n.', 'A wandering; a roving about.'),
(25937, 'Errata', 'pl. ', 'of Erratum'),
(25938, 'Erratum', 'n.', 'An error or mistake in writing or printing.'),
(25939, 'Erthine', 'n.', 'A medicine designed to be snuffed up the nose, to promote\n   discharges of mucus; a sternutatory.'),
(25940, 'Erthine', 'a.', 'Causing or increasing secretion of nasal mucus.'),
(25941, 'Error', 'n.', 'A wandering; a roving or irregular course.'),
(25942, 'Error', 'n.', 'A wandering or deviation from the right course or standard;\n   irregularity; mistake; inaccuracy; something made wrong or left wrong;\n   as, an error in writing or in printing; a clerical error.'),
(25943, 'Error', 'n.', 'A departing or deviation from the truth; falsity; false\n   notion; wrong opinion; mistake; misapprehension.'),
(25944, 'Error', 'n.', 'A moral offense; violation of duty; a sin or transgression;\n   iniquity; fault.'),
(25945, 'Error', 'n.', 'The difference between the approximate result and the true\n   result; -- used particularly in the rule of double position.'),
(25946, 'Error', 'n.', 'The difference between an observed value and the true value\n   of a quantity.'),
(25947, 'Error', 'n.', 'The difference between the observed value of a quantity and\n   that which is taken or computed to be the true value; -- sometimes\n   called residual error.'),
(25948, 'Error', 'n.', 'A mistake in the proceedings of a court of record in matters\n   of law or of fact.'),
(25949, 'Error', 'n.', 'A fault of a player of the side in the field which results\n   in failure to put out a player on the other side, or gives him an\n   unearned base.'),
(25950, 'Errorful', 'a.', 'Full of error; wrong.'),
(25951, 'Errorist', 'n.', 'One who encourages and propagates error; one who holds to\n   error.'),
(25952, 'Erucae', 'pl. ', 'of Eruca'),
(25953, 'Eruca', 'n.', 'An insect in the larval state; a caterpillar; a larva.'),
(25954, 'Erucic', 'a.', 'Pertaining to, or derived from, a genus of cruciferous\n   Mediterranean herbs (Eruca or Brassica); as, erucic acid, a fatty acid\n   resembling oleic acid, and found in colza oil, mustard oil, etc.'),
(25955, 'Eruct', 'v. t.', 'Alt. of Eructate'),
(25956, 'Eructate', 'v. t.', 'To eject, as wind, from the stomach; to belch.'),
(25957, 'Erudiate', 'v. t.', 'To instruct; to educate; to teach.'),
(25958, 'Erudite', 'a.', 'Characterized by extensive reading or knowledge; well\n   instructed; learned.'),
(25959, 'Erugate', 'a.', 'Freed from wrinkles; smooth.'),
(25960, 'Erumpent', 'a.', 'Breaking out; -- said of certain fungi which burst\n   through the texture of leaves.'),
(25961, 'Erupt', 'v. t.', 'To cause to burst forth; to eject; as, to erupt lava.'),
(25962, 'Eruption', 'n.', 'The act of breaking out or bursting forth; as: (a) A\n   violent throwing out of flames, lava, etc., as from a volcano of a\n   fissure in the earth\'s crust. (b) A sudden and overwhelming hostile\n   movement of armed men from one country to another. Milton. (c) A\n   violent commotion.'),
(25963, 'Eruption', 'n.', 'That which bursts forth.'),
(25964, 'Eruption', 'n.', 'A violent exclamation; ejaculation.'),
(25965, 'Eruption', 'n.', 'The breaking out of pimples, or an efflorescence, as in\n   measles, scarlatina, etc.'),
(25966, 'Eruptive', 'a.', 'Breaking out or bursting forth.'),
(25967, 'Eruptive', 'a.', 'Attended with eruption or efflorescence, or producing it;\n   as, an eruptive fever.'),
(25968, 'Eruptive', 'a.', 'Produced by eruption; as, eruptive rocks, such as the\n   igneous or volcanic.'),
(25969, 'Eruptive', 'n.', 'An eruptive rock.'),
(25970, 'Eryngium', 'n.', 'A genus of umbelliferous plants somewhat like thistles in\n   appearance. Eryngium maritimum, or sea holly, has been highly esteemed\n   as an aphrodisiac, the roots being formerly candied.'),
(25971, 'Eryngo', 'n.', 'A plant of the genus Eryngium.'),
(25972, 'Erythema', 'n.', 'A disease of the skin, in which a diffused inflammation\n   forms rose-colored patches of variable size.'),
(25973, 'Erythric', 'a.', 'Pertaining to, derived from, or resembling, erythrin.'),
(25974, 'Erythrin', 'n.', 'Alt. of Erythrine'),
(25975, 'Escalade', 'v. t.', 'A furious attack made by troops on a fortified place,\n   in which ladders are used to pass a ditch or mount a rampart.'),
(25976, 'Escalade', 'v. t.', 'To mount and pass or enter by means of ladders; to\n   scale; as, to escalate a wall.'),
(25977, 'Escallop', 'n.', 'See Escalop.'),
(25978, 'Escalop', 'n.', 'A bivalve shell of the genus Pecten. See Scallop.'),
(25979, 'Escalop', 'n.', 'A regular, curving indenture in the margin of anything.\n   See Scallop.'),
(25980, 'Escalop', 'n.', 'The figure or shell of an escalop, considered as a sign\n   that the bearer had been on a pilgrimage to the Holy Land.'),
(25981, 'Escalop', 'n.', 'A bearing or a charge consisting of an escalop shell.'),
(25982, 'Escambio', 'n.', 'A license formerly required for the making over a bill of\n   exchange to another over sea.'),
(25983, 'Escapade', 'n.', 'The fling of a horse, or ordinary kicking back of his\n   heels; a gambol.'),
(25984, 'Escapade', 'n.', 'Act by which one breaks loose from the rules of propriety\n   or good sense; a freak; a prank.'),
(25985, 'Escaped', 'imp. & p. p.', 'of Escape'),
(25986, 'Escaping', 'p. pr. & vb. n.', 'of Escape'),
(25987, 'Escape', 'v.', 'To flee from and avoid; to be saved or exempt from; to\n   shun; to obtain security from; as, to escape danger.'),
(25988, 'Escape', 'v.', 'To avoid the notice of; to pass unobserved by; to evade;\n   as, the fact escaped our attention.'),
(25989, 'Escape', 'v. i.', 'To flee, and become secure from danger; -- often\n   followed by from or out of.'),
(25990, 'Escape', 'v. i.', 'To get clear from danger or evil of any form; to be\n   passed without harm.'),
(25991, 'Escape', 'v. i.', 'To get free from that which confines or holds; -- used\n   of persons or things; as, to escape from prison, from arrest, or from\n   slavery; gas escapes from the pipes; electricity escapes from its\n   conductors.'),
(25992, 'Escape', 'n.', 'The act of fleeing from danger, of evading harm, or of\n   avoiding notice; deliverance from injury or any evil; flight; as, an\n   escape in battle; a narrow escape; also, the means of escape; as, a\n   fire escape.'),
(25993, 'Escape', 'n.', 'That which escapes attention or restraint; a mistake; an\n   oversight; also, transgression.'),
(25994, 'Escape', 'n.', 'A sally.'),
(25995, 'Escape', 'n.', 'The unlawful permission, by a jailer or other custodian, of\n   a prisoner\'s departure from custody.'),
(25996, 'Escape', 'n.', 'An apophyge.'),
(25997, 'Escape', 'n.', 'Leakage or outflow, as of steam or a liquid.'),
(25998, 'Escape', 'n.', 'Leakage or loss of currents from the conducting wires,\n   caused by defective insulation.'),
(25999, 'Escaper', 'n.', 'One who escapes.'),
(26000, 'Escarp', 'n.', 'The side of the ditch next the parapet; -- same as scarp,\n   and opposed to counterscarp.'),
(26001, 'Escarped', 'imp. & p. p.', 'of Escarp'),
(26002, 'Escarp', 'v. t.', 'To make into, or furnish with, a steep slope, like that\n   of a scrap.'),
(26003, '-escent', '', 'A suffix signifying beginning, beginning to be; as,\n   adolescent, effervescent, etc.'),
(26004, 'Eschalot', 'n.', 'See Shallot.'),
(26005, 'Eschar', 'n.', 'A dry slough, crust, or scab, which separates from the\n   healthy part of the body, as that produced by a burn, or the\n   application of caustics.'),
(26006, 'Eschar', 'n.', 'In Ireland, one of the continuous mounds or ridges of\n   gravelly and sandy drift which extend for many miles over the surface\n   of the country. Similar ridges in Scotland are called kames or kams.'),
(26007, 'Eschara', 'n.', 'A genus of Bryozoa which produce delicate corals, often\n   incrusting like lichens, but sometimes branched.'),
(26008, 'Escheat', 'n.', 'The falling back or reversion of lands, by some casualty\n   or accident, to the lord of the fee, in consequence of the extinction\n   of the blood of the tenant, which may happen by his dying without\n   heirs, and formerly might happen by corruption of blood, that is, by\n   reason of a felony or attainder.'),
(26009, 'Escheat', 'n.', 'The reverting of real property to the State, as original\n   and ultimate proprietor, by reason of a failure of persons legally\n   entitled to hold the same.'),
(26010, 'Escheat', 'n.', 'A writ, now abolished, to recover escheats from the person\n   in possession.'),
(26011, 'Escheat', 'n.', 'Lands which fall to the lord or the State by escheat.'),
(26012, 'Escheat', 'n.', 'That which falls to one; a reversion or return'),
(26013, 'Esheated', 'imp. & p. p.', 'of Escheat'),
(26014, 'Escheat', 'v. i.', 'To revert, or become forfeited, to the lord, the crown,\n   or the State, as lands by the failure of persons entitled to hold the\n   same, or by forfeiture.'),
(26015, 'Escheat', 'v. t.', 'To forfeit.'),
(26016, 'Eschevin', 'n.', 'The alderman or chief officer of an ancient guild.'),
(26017, 'Eshewed', 'imp. & p. p.', 'of Eschew'),
(26018, 'Eshewing', 'p. pr. & vb. n.', 'of Eschew'),
(26019, 'Eschew', 'a.', 'To shun; to avoid, as something wrong, or from a feeling of\n   distaste; to keep one\'s self clear of.'),
(26020, 'Eschew', 'a.', 'To escape from; to avoid.'),
(26021, 'Eschewer', 'n.', 'One who eschews.'),
(26022, 'Escopet', 'n.', 'Alt. of Escopette'),
(26023, 'Escorial', 'n.', 'See Escurial.'),
(26024, 'Escort', 'n.', 'A body of armed men to attend a person of distinction for\n   the sake of affording safety when on a journey; one who conducts some\n   one as an attendant; a guard, as of prisoners on a march; also, a body\n   of persons, attending as a mark of respect or honor; -- applied to\n   movements on land, as convoy is to movements at sea.'),
(26025, 'Escort', 'n.', 'Protection, care, or safeguard on a journey or excursion;\n   as, to travel under the escort of a friend.'),
(26026, 'Escorted', 'imp. & p. p.', 'of Escort'),
(26027, 'Escort', 'n.', 'To attend with a view to guard and protect; to accompany as\n   safeguard; to give honorable or ceremonious attendance to; -- used esp.\n   with reference to journeys or excursions on land; as, to escort a\n   public functionary, or a lady; to escort a baggage wagon.'),
(26028, 'Escot', 'n.', 'See Scot, a tax.'),
(26029, 'Escot', 'v. t.', 'To pay the reckoning for; to support; to maintain.'),
(26030, 'Escouade', 'n.', 'See Squad,'),
(26031, 'Escout', 'n.', 'See Scout.'),
(26032, 'Escribed', 'a.', 'Drawn outside of; -- used to designate a circle that\n   touches one of the sides of a given triangle, and also the other two\n   sides produced.'),
(26033, 'Escript', 'n.', 'A writing.'),
(26034, 'Escrod', 'n.', 'See Scrod, a young cod.'),
(26035, 'Escrol', 'n.', 'Alt. of Escroll'),
(26036, 'Escroll', 'n.', 'A scroll.'),
(26037, 'Escroll', 'n.', 'A long strip or scroll resembling a ribbon or a band of\n   parchment, or the like, anciently placed above the shield, and\n   supporting the crest.'),
(26038, 'Escroll', 'n.', 'In modern heraldry, a similar ribbon on which the motto is\n   inscribed.'),
(26039, 'Escrow', 'n.', 'A deed, bond, or other written engagement, delivered to a\n   third person, to be held by him till some act is done or some condition\n   is performed, and then to be by him delivered to the grantee.'),
(26040, 'Escuage', 'n.', 'Service of the shield, a species of knight service by\n   which a tenant was bound to follow his lord to war, at his own charge.\n   It was afterward exchanged for a pecuniary satisfaction. Called also\n   scutage.'),
(26041, 'Esculent', 'a.', 'Suitable to be used by man for food; eatable; edible; as,\n   esculent plants; esculent fish.'),
(26042, 'Esculent', 'n.', 'Anything that is fit for eating; that which may be safely\n   eaten by man.'),
(26043, 'Esculic', 'a.', 'Pertaining to, or obtained from, the horse-chestnut; as,\n   esculic acid.'),
(26044, 'Esculin', 'n.', 'A glucoside obtained from the Aesculus hippocastanum, or\n   horse-chestnut, and characterized by its fine blue fluorescent\n   solutions.'),
(26045, 'Escurial', 'n.', 'A palace and mausoleum of the kinds of Spain, being a\n   vast and wonderful structure about twenty-five miles northwest of\n   Madrid.'),
(26046, 'Eserine', 'n.', 'An alkaloid found in the Calabar bean, and the seed of\n   Physostigma venenosum; physostigmine. It is used in ophthalmic surgery\n   for its effect in contracting the pupil.'),
(26047, 'Esexual', 'a.', 'Sexless; asexual.'),
(26048, 'Esguard', 'n.', 'Guard.'),
(26049, 'Eskar', 'n.', 'Alt. of Esker'),
(26050, 'Esker', 'n.', 'See Eschar.'),
(26051, 'Eskimos', 'pl. ', 'of Eskimo'),
(26052, 'Eskimo', 'n.', 'One of a peculiar race inhabiting Arctic America and\n   Greenland. In many respects the Eskimos resemble the Mongolian race.'),
(26053, 'Esloin', 'v. t.', 'To remove; to banish; to withdraw; to avoid; to eloign.'),
(26054, 'Esnecy', 'n.', 'A prerogative given to the eldest coparcener to choose\n   first after an inheritance is divided.'),
(26055, 'Esodic', 'a.', 'Conveying impressions from the surface of the body to the\n   spinal cord; -- said of certain nerves. Opposed to exodic.'),
(26056, 'Esopian', 'a.', 'Alt. of Esopic'),
(26057, 'Esopic', 'a.', 'Same as Aesopian, Aesopic.'),
(26058, 'Esoteric', 'a.', 'Designed for, and understood by, the specially initiated\n   alone; not communicated, or not intelligible, to the general body of\n   followers; private; interior; acroamatic; -- said of the private and\n   more recondite instructions and doctrines of philosophers. Opposed to\n   exoteric.'),
(26059, 'Esotery', 'n.', 'Mystery; esoterics; -- opposed to exotery.'),
(26060, 'Espace', 'n.', 'Space.'),
(26061, 'Espadon', 'n.', 'A long, heavy, two-handed and two-edged sword, formerly\n   used by Spanish foot soldiers and by executioners.'),
(26062, 'Espalier', 'n.', 'A railing or trellis upon which fruit trees or shrubs are\n   trained, as upon a wall; a tree or row of trees so trained.'),
(26063, 'Espalier', 'v. t.', 'To form an espalier of, or to protect by an espalier.'),
(26064, 'Esparcet', 'n.', 'The common sainfoin (Onobrychis sativa), an Old World\n   leguminous forage plant.'),
(26065, 'Esparto', 'n.', 'A species of Spanish grass (Macrochloa tenacissima), of\n   which cordage, shoes, baskets, etc., are made. It is also used for\n   making paper.'),
(26066, 'Especial', 'a.', 'Distinguished among others of the same class or kind;\n   special; concerning a species or a single object; principal;\n   particular; as, in an especial manner or degree.'),
(26067, 'Espial', 'n.', 'The act of espying; notice; discovery.'),
(26068, 'Espial', 'n.', 'One who espies; a spy; a scout.'),
(26069, 'Espier', 'n.', 'One who espies.'),
(26070, 'Espinel', 'n.', 'A kind of ruby. See Spinel.'),
(26071, 'Esplees', 'n. pl.', 'The full profits or products which ground or land\n   yields, as the hay of the meadows, the feed of the pasture, the grain\n   of arable fields, the rents, services, and the like.'),
(26072, 'Espousal', 'n.', 'The act of espousing or betrothing; especially, in the\n   plural, betrothal; plighting of the troths; a contract of marriage;\n   sometimes, the marriage ceremony.'),
(26073, 'Espousal', 'n.', 'The uniting or allying one\'s self with anything;\n   maintenance; adoption; as, the espousal of a quarrel.'),
(26074, 'Espoused', 'imp. & p. p.', 'of Espouse'),
(26075, 'Espouse', 'v. t.', 'To betroth; to promise in marriage; to give as spouse.'),
(26076, 'Espouse', 'v. t.', 'To take as spouse; to take to wife; to marry.'),
(26077, 'Espouse', 'v. t.', 'To take to one\'s self with a view to maintain; to make\n   one\'s own; to take up the cause of; to adopt; to embrace.'),
(26078, 'Espouser', 'n.', 'One who espouses; one who embraces the cause of another\n   or makes it his own.'),
(26079, 'Esprit', 'n.', 'Spirit.'),
(26080, 'Espied', 'imp. & p. p.', 'of Espy'),
(26081, 'Espying', 'p. pr. & vb. n.', 'of Espy'),
(26082, 'Espies', 'pl. ', 'of Espy'),
(26083, '-esque', '', 'A suffix of certain words from the French, Italian, and\n   Spanish. It denotes manner or style; like; as, arabesque, after the\n   manner of the Arabs.'),
(26084, 'Esquimau', 'n.', 'Same as Eskimo.'),
(26085, 'Esquire', 'n.', 'Originally, a shield-bearer or armor-bearer, an attendant\n   on a knight; in modern times, a title of dignity next in degree below\n   knight and above gentleman; also, a title of office and courtesy; --\n   often shortened to squire.'),
(26086, 'Esquired', 'imp. & p. p.', 'of Esquire'),
(26087, 'Esquire', 'v. t.', 'To wait on as an esquire or attendant in public; to\n   attend.'),
(26088, 'Esquisse', 'n.', 'The first sketch of a picture or model of a statue.'),
(26089, 'Essays', 'pl. ', 'of Essay'),
(26090, 'Essay', 'n.', 'An effort made, or exertion of body or mind, for the\n   performance of anything; a trial; attempt; as, to make an essay to\n   benefit a friend.'),
(26091, 'Essay', 'n.', 'A composition treating of any particular subject; -- usually\n   shorter and less methodical than a formal, finished treatise; as, an\n   essay on the life and writings of Homer; an essay on fossils, or on\n   commerce.'),
(26092, 'Essay', 'n.', 'An assay. See Assay, n.'),
(26093, 'Essayed', 'imp. & p. p.', 'of Essay'),
(26094, 'Essaying', 'p. pr. & vb. n.', 'of Essay'),
(26095, 'Essay', 'n.', 'To exert one\'s power or faculties upon; to make an effort to\n   perform; to attempt; to endeavor; to make experiment or trial of; to\n   try.'),
(26096, 'Essay', 'n.', 'To test the value and purity of (metals); to assay. See\n   Assay.'),
(26097, 'Essayer', 'n.', 'One who essays.'),
(26098, 'Essayist', 'n.', 'A writer of an essay, or of essays.'),
(26099, 'Essence', 'n.', 'The constituent elementary notions which constitute a\n   complex notion, and must be enumerated to define it; sometimes called\n   the nominal essence.'),
(26100, 'Essence', 'n.', 'The constituent quality or qualities which belong to any\n   object, or class of objects, or on which they depend for being what\n   they are (distinguished as real essence); the real being, divested of\n   all logical accidents; that quality which constitutes or marks the true\n   nature of anything; distinctive character; hence, virtue or quality of\n   a thing, separated from its grosser parts.'),
(26101, 'Essence', 'n.', 'Constituent substance.'),
(26102, 'Essence', 'n.', 'A being; esp., a purely spiritual being.'),
(26103, 'Essence', 'n.', 'The predominant qualities or virtues of a plant or drug,\n   extracted and refined from grosser matter; or, more strictly, the\n   solution in spirits of wine of a volatile or essential oil; as, the\n   essence of mint, and the like.'),
(26104, 'Essence', 'n.', 'Perfume; odor; scent; or the volatile matter constituting\n   perfume.'),
(26105, 'Essenced', 'imp. & p. p.', 'of Essence'),
(26106, 'Essence', 'v. t.', 'To perfume; to scent.'),
(26107, 'Essenes', 'pl. ', 'of Essene'),
(26108, 'Essene', 'n.', 'One of a sect among the Jews in the time of our Savior,\n   remarkable for their strictness and abstinence.'),
(26109, 'Essenism', 'n.', 'The doctrine or the practices of the Essenes.'),
(26110, 'Esential', 'n.', 'Existence; being.'),
(26111, 'Esential', 'n.', 'That which is essential; first or constituent principle;\n   as, the essentials or religion.'),
(26112, 'Essoin', 'n.', 'Alt. of Essoign'),
(26113, 'Essoign', 'n.', 'An excuse for not appearing in court at the return of\n   process; the allegation of an excuse to the court.'),
(26114, 'Essoign', 'n.', 'Excuse; exemption.'),
(26115, 'Essoin', 'n.', 'To excuse for nonappearance in court.'),
(26116, 'Essoiner', 'n.', 'An attorney who sufficiently excuses the absence of\n   another.'),
(26117, 'Essonite', 'n.', 'Cinnamon stone, a variety of garnet. See Garnet.'),
(26118, 'Essorant', 'a.', 'Standing, but with the wings spread, as if about to fly;\n   -- said of a bird borne as a charge on an escutcheon.'),
(26119, 'Estacade', 'n.', 'A dike of piles in the sea, a river, etc., to check the\n   approach of an enemy.'),
(26120, 'Estafet', 'n.', 'Alt. of Estafette'),
(26121, 'Estancia', 'n.', 'A grazing; a country house.'),
(26122, 'Estate', 'n.', 'Settled condition or form of existence; state; condition or\n   circumstances of life or of any person; situation.'),
(26123, 'Estate', 'n.', 'Social standing or rank; quality; dignity.'),
(26124, 'Estate', 'n.', 'A person of high rank.'),
(26125, 'Estate', 'n.', 'A property which a person possesses; a fortune;\n   possessions, esp. property in land; also, property of all kinds which a\n   person leaves to be divided at his death.'),
(26126, 'Estate', 'n.', 'The state; the general body politic; the common-wealth; the\n   general interest; state affairs.'),
(26127, 'Estate', 'n.', 'The great classes or orders of a community or state (as the\n   clergy, the nobility, and the commonalty of England) or their\n   representatives who administer the government; as, the estates of the\n   realm (England), which are (1) the lords spiritual, (2) the lords\n   temporal, (3) the commons.'),
(26128, 'Estate', 'n.', 'The degree, quality, nature, and extent of one\'s interest\n   in, or ownership of, lands, tenements, etc.; as, an estate for life,\n   for years, at will, etc.'),
(26129, 'Estate', 'v. t.', 'To establish.'),
(26130, 'Estate', 'v. t.', 'Tom settle as a fortune.'),
(26131, 'Estate', 'v. t.', 'To endow with an estate.'),
(26132, 'Estatly', 'a.', 'Stately; dignified.'),
(26133, 'Esteemed', 'imp. & p. p.', 'of Esteem'),
(26134, 'Esteem', 'v. t.', 'To set a value on; to appreciate the worth of; to\n   estimate; to value; to reckon.'),
(26135, 'Esteem', 'v. t.', 'To set a high value on; to prize; to regard with\n   reverence, respect, or friendship.'),
(26136, 'Esteem', 'v. i.', 'To form an estimate; to have regard to the value; to\n   consider.'),
(26137, 'Esteem', 'v. t.', 'Estimation; opinion of merit or value; hence, valuation;\n   reckoning; price.'),
(26138, 'Esteem', 'v. t.', 'High estimation or value; great regard; favorable\n   opinion, founded on supposed worth.'),
(26139, 'Esteemer', 'n.', 'One who esteems; one who sets a high value on any thing.'),
(26140, 'Ester', 'n.', 'An ethereal salt, or compound ether, consisting of an\n   organic radical united with the residue of any oxygen acid, organic or\n   inorganic; thus the natural fats are esters of glycerin and the fatty\n   acids, oleic, etc.'),
(26141, 'Esthete', 'n.', 'Alt. of Esthetics'),
(26142, 'Esthetic', 'n.', 'Alt. of Esthetics'),
(26143, 'Estimate', 'v. t.', 'To judge and form an opinion of the value of, from\n   imperfect data, -- either the extrinsic (money), or intrinsic (moral),\n   value; to fix the worth of roughly or in a general way; as, to estimate\n   the value of goods or land; to estimate the worth or talents of a\n   person.'),
(26144, 'Estimate', 'v. t.', 'To from an opinion of, as to amount,, number, etc.,\n   from imperfect data, comparison, or experience; to make an estimate of;\n   to calculate roughly; to rate; as, to estimate the cost of a trip, the\n   number of feet in a piece of land.'),
(26145, 'Estimate', 'n.', 'A valuing or rating by the mind, without actually\n   measuring, weighing, or the like; rough or approximate calculation; as,\n   an estimate of the cost of a building, or of the quantity of water in a\n   pond.'),
(26146, 'Estival', 'n.', 'Alt. of Estivation'),
(26147, 'Estivate', 'n.', 'Alt. of Estivation'),
(26148, 'Estoile', 'n.', 'A six-pointed star whose rays are wavy, instead of\n   straight like those of a mullet.'),
(26149, 'Estophed', 'imp. & p. p.', 'of Estop'),
(26150, 'Estop', 'v. t.', 'To impede or bar by estoppel.'),
(26151, 'Estoppel', 'n.', 'A stop; an obstruction or bar to one\'s alleging or\n   denying a fact contrary to his own previous action, allegation, or\n   denial; an admission, by words or conduct, which induces another to\n   purchase rights, against which the party making such admission can not\n   take a position inconsistent with the admission.'),
(26152, 'Estoppel', 'n.', 'The agency by which the law excludes evidence to dispute\n   certain admissions, which the policy of the law treats as indisputable.'),
(26153, 'Estovers', 'n. pl.', 'Necessaries or supples; an allowance to a person out\n   of an estate or other thing for support; as of wood to a tenant for\n   life, etc., of sustenance to a man confined for felony of his estate,\n   or alimony to a woman divorced out of her husband\'s estate.'),
(26154, 'Estrade', 'n.', 'A portion of the floor of a room raised above the general\n   level, as a place for a bed or a throne; a platform; a dais.'),
(26155, 'Estrange', 'v. t.', 'To withdraw; to withhold; hence, reflexively, to keep\n   at a distance; to cease to be familiar and friendly with.'),
(26156, 'Estrange', 'v. t.', 'To divert from its original use or purpose, or from\n   its former possessor; to alienate.'),
(26157, 'Estrange', 'v. t.', 'To alienate the affections or confidence of; to turn\n   from attachment to enmity or indifference.'),
(26158, 'Estray', 'v. i.', 'To stray.'),
(26159, 'Estray', 'n.', 'Any valuable animal, not wild, found wandering from its\n   owner; a stray.'),
(26160, 'Estre', 'n.', 'The inward part of a building; the interior.'),
(26161, 'Estreat', 'n.', 'A true copy, duplicate, or extract of an original writing\n   or record, esp. of amercements or penalties set down in the rolls of\n   court to be levied by the bailiff, or other officer.'),
(26162, 'Estreat', 'v. t.', 'To extract or take out from the records of a court, and\n   send up to the court of exchequer to be enforced; -- said of a\n   forfeited recognizance.'),
(26163, 'Estreat', 'v. t.', 'To bring in to the exchequer, as a fine.'),
(26164, 'Estrepe', 'v. t.', 'To strip or lay bare, as land of wood, houses, etc.; to\n   commit waste.'),
(26165, 'Estrich', 'n.', 'Ostrich.'),
(26166, 'Estrich', 'n.', 'The down of the ostrich.'),
(26167, 'Estuance', 'n.', 'Heat.'),
(26168, 'Estuary', 'n.', 'A place where water boils up; a spring that wells forth.'),
(26169, 'Estuary', 'n.', 'A passage, as the mouth of a river or lake, where the tide\n   meets the current; an arm of the sea; a frith.'),
(26170, 'Estuary', 'a.', 'Belonging to, or formed in, an estuary; as, estuary\n   strata.'),
(26171, 'Estuated', 'imp. & p. p.', 'of Estuate'),
(26172, 'Estuate', 'v. i.', 'To boil up; to swell and rage; to be agitated.'),
(26173, 'Estufas', 'pl. ', 'of Estufa'),
(26174, 'Estufa', 'n.', 'An assembly room in dwelling of the Pueblo Indians.'),
(26175, 'Esture', 'n.', 'Commotion.'),
(26176, 'Esurient', 'a.', 'Inclined to eat; hungry; voracious.'),
(26177, 'Esurient', 'n.', 'One who is hungry or greedy.'),
(26178, 'Esurine', 'a.', 'Causing hunger; eating; corroding.'),
(26179, 'Esurine', 'n.', 'A medicine which provokes appetites, or causes hunger.'),
(26180, 'Etaac', 'n.', 'The blue buck.'),
(26181, 'Etacism', 'n.', 'The pronunciation of the Greek / (eta) like the Italian e\n   long, that is like a in the English word ate. See Itacism.'),
(26182, 'Etacist', 'n.', 'One who favors etacism.'),
(26183, 'Etagere', 'n.', 'A piece of furniture having a number of uninclosed shelves\n   or stages, one above another, for receiving articles of elegance or\n   use.'),
(26184, 'Etched', 'imp. & p. p.', 'of Etch'),
(26185, 'Etching', 'p. pr. & vb. n.', 'of Etch'),
(26186, 'Etcher', 'n.', 'One who etches.'),
(26187, 'Etching', 'n.', 'The act, art, or practice of engraving by means of acid\n   which eats away lines or surfaces left unprotected in metal, glass, or\n   the like. See Etch, v. t.'),
(26188, 'Etching', 'v. t.', 'A design carried out by means of the above process; a\n   pattern on metal, glass, etc., produced by etching.'),
(26189, 'Etching', 'v. t.', 'An impression on paper, parchment, or other material,\n   taken in ink from an etched plate.'),
(26190, 'Eteostic', 'n.', 'A kind of chronogram.'),
(26191, 'Etern', 'a.', 'Alt. of Eterne'),
(26192, 'Eterne', 'a.', 'Eternal.'),
(26193, 'Eternal', 'a.', 'Without beginning or end of existence; always existing.'),
(26194, 'Eternal', 'a.', 'Without end of existence or duration; everlasting;\n   endless; immortal.'),
(26195, 'Eternal', 'a.', 'Continued without intermission; perpetual; ceaseless;\n   constant.'),
(26196, 'Eternal', 'a.', 'Existing at all times without change; immutable.'),
(26197, 'Eternal', 'a.', 'Exceedingly great or bad; -- used as a strong intensive.'),
(26198, 'Eternal', 'n.', 'One of the appellations of God.'),
(26199, 'Eternal', 'n.', 'That which is endless and immortal.'),
(26200, 'Eterne', 'a.', 'See Etern.'),
(26201, 'Eternify', 'v. t.', 'To make eternal.'),
(26202, 'Eternity', 'n.', 'Infinite duration, without beginning in the past or end\n   in the future; also, duration without end in the future; endless time.'),
(26203, 'Eternity', 'n.', 'Condition which begins at death; immortality.'),
(26204, 'Eternize', 'v. t.', 'To make eternal or endless.'),
(26205, 'Eternize', 'v. t.', 'To make forever famous; to immortalize; as, to\n   eternize one\'s self, a name, exploits.'),
(26206, 'Etesian', 'a.', 'Periodical; annual; -- applied to winds which annually\n   blow from the north over the Mediterranean, esp. the eastern part, for\n   an irregular period during July and August.'),
(26207, 'Ethal', 'n.', 'A white waxy solid, C16H33.OH; -- called also cetylic\n   alcohol. See Cetylic alcohol, under Cetylic.'),
(26208, 'Ethane', 'n.', 'A gaseous hydrocarbon, C2H6, forming a constituent of\n   ordinary illuminating gas. It is the second member of the paraffin\n   series, and its most important derivatives are common alcohol,\n   aldehyde, ether, and acetic acid. Called also dimethyl.'),
(26209, 'Ethel', 'a.', 'Noble.'),
(26210, 'Ethene', 'n.', 'Ethylene; olefiant gas.'),
(26211, 'Ethenic', 'a.', 'Pertaining to, derived from. or resembling, ethene or\n   ethylene; as, ethenic ether.'),
(26212, 'Ethenyl', 'n.', 'A trivalent hydrocarbon radical, CH3.C.'),
(26213, 'Ethenyl', 'n.', 'A univalent hydrocarbon radical of the ethylene series,\n   CH2:CH; -- called also vinyl. See Vinyl.'),
(26214, 'Ether', 'n.', 'A medium of great elasticity and extreme tenuity, supposed\n   to pervade all space, the interior of solid bodies not excepted, and to\n   be the medium of transmission of light and heat; hence often called\n   luminiferous ether.'),
(26215, 'Ether', 'n.', 'Supposed matter above the air; the air itself.'),
(26216, 'Ether', 'n.', 'A light, volatile, mobile, inflammable liquid, (C2H5)2O, of\n   a characteristic aromatic odor, obtained by the distillation of alcohol\n   with sulphuric acid, and hence called also sulphuric ether. It is\n   powerful solvent of fats, resins, and pyroxylin, but finds its chief\n   use as an anaesthetic. Called also ethyl oxide.'),
(26217, 'Ether', 'n.', 'Any similar oxide of hydrocarbon radicals; as, amyl ether;\n   valeric ether.'),
(26218, 'Ethereal', 'a.', 'Pertaining to the hypothetical upper, purer air, or to\n   the higher regions beyond the earth or beyond the atmosphere;\n   celestial; as, ethereal space; ethereal regions.'),
(26219, 'Ethereal', 'a.', 'Consisting of ether; hence, exceedingly light or airy;\n   tenuous; spiritlike; characterized by extreme delicacy, as form,\n   manner, thought, etc.'),
(26220, 'Ethereal', 'a.', 'Pertaining to, derived from, or resembling, ether; as,\n   ethereal salts.'),
(26221, 'Etherin', 'n.', 'A white, crystalline hydrocarbon, regarded as a polymeric\n   variety of ethylene, obtained in heavy oil of wine, the residue left\n   after making ether; -- formerly called also concrete oil of wine.'),
(26222, 'Etherize', 'v. t.', 'To convert into ether.'),
(26223, 'Etherize', 'v. t.', 'To render insensible by means of ether, as by\n   inhalation; as, to etherize a patient.'),
(26224, 'Etherol', 'n.', 'An oily hydrocarbon regarded as a polymeric variety of\n   ethylene, produced with etherin.'),
(26225, 'Ethic', 'a.', 'Alt. of Ethical'),
(26226, 'Ethical', 'a.', 'Of, or belonging to, morals; treating of the moral\n   feelings or duties; containing percepts of morality; moral; as, ethic\n   discourses or epistles; an ethical system; ethical philosophy.'),
(26227, 'Ethicist', 'n.', 'One who is versed in ethics, or has written on ethics.'),
(26228, 'Ethics', 'n.', 'The science of human duty; the body of rules of duty drawn\n   from this science; a particular system of principles and rules\n   concerting duty, whether true or false; rules of practice in respect to\n   a single class of human actions; as, political or social ethics;\n   medical ethics.'),
(26229, 'Ethide', 'n.', 'Any compound of ethyl of a binary type; as, potassium\n   ethide.'),
(26230, 'Ethidene', 'n.', 'Ethylidene.'),
(26231, 'Ethine', 'n.', 'Acetylene.'),
(26232, 'Ethionic', 'a.', 'Pertaining to, derived from, or designating, an acid so\n   called.'),
(26233, 'Ethiop', 'n.', 'Alt. of Ethiopian'),
(26234, 'Ethiopic', 'a.', 'Of or relating to Ethiopia or the Ethiopians.'),
(26235, 'Ethiopic', 'n.', 'The language of ancient Ethiopia; the language of the\n   ancient Abyssinian empire (in Ethiopia), now used only in the\n   Abyssinian church. It is of Semitic origin, and is also called Geez.'),
(26236, 'Ethiops', 'n.', 'A black substance; -- formerly applied to various\n   preparations of a black or very dark color.'),
(26237, 'Ethmoid', 'a.', 'Alt. of Ethmoidal'),
(26238, 'Ethmoid', 'n.', 'The ethmoid bone.'),
(26239, 'Ethnarch', 'n.', 'The governor of a province or people.'),
(26240, 'Ethnic', 'a.', 'Alt. of Ethnical'),
(26241, 'Ethnical', 'a.', 'Belonging to races or nations; based on distinctions of\n   race; ethnological.'),
(26242, 'Ethnical', 'a.', 'Pertaining to the gentiles, or nations not converted to\n   Christianity; heathen; pagan; -- opposed to Jewish and Christian.'),
(26243, 'Ethnic', 'n.', 'A heathen; a pagan.'),
(26244, 'Ethology', 'n.', 'A treatise on morality; ethics.'),
(26245, 'Ethology', 'n.', 'The science of the formation of character, national and\n   collective as well as individual.'),
(26246, 'Ethule', '', 'Ethyl.'),
(26247, 'Ethyl', 'n.', 'A monatomic, hydrocarbon radical, C2H5 of the paraffin\n   series, forming the essential radical of ethane, and of common alcohol\n   and ether.'),
(26248, 'Ethylate', 'n.', 'A compound derived from ethyl alcohol by the replacement\n   of the hydroxyl hydrogen, after the manner of a hydrate; an ethyl\n   alcoholate; as, potassium ethylate, C2H5.O.K.'),
(26249, 'Ethylene', 'n.', 'A colorless, gaseous hydrocarbon, C2H4, forming an\n   important ingredient of illuminating gas, and also obtained by the\n   action of concentrated sulphuric acid in alcohol. It is an unsaturated\n   compound and combines directly with chlorine and bromine to form oily\n   liquids (Dutch liquid), -- hence called olefiant gas. Called also\n   ethene, elayl, and formerly, bicarbureted hydrogen.'),
(26250, 'Ethylic', '', 'Pertaining to, derived from, or containing, ethyl; as,\n   ethylic alcohol.'),
(26251, 'Ethylin', '', 'Any one of the several complex ethers of ethyl and glycerin.'),
(26252, 'Etiolate', 'v. i.', 'To become white or whiter; to be whitened or blanched\n   by excluding the light of the sun, as, plants.'),
(26253, 'Etiolate', 'v. i.', 'To become pale through disease or absence of light.'),
(26254, 'Etiolate', 'v. t.', 'To blanch; to bleach; to whiten by depriving of the\n   sun\'s rays.'),
(26255, 'Etiolate', 'v. t.', 'To cause to grow pale by disease or absence of light.'),
(26256, 'Etiolate', 'a.', 'Alt. of Etiolated'),
(26257, 'Etoolin', 'n.', 'A yellowish coloring matter found in plants grown in\n   darkness, which is supposed to be an antecedent condition of\n   chlorophyll.'),
(26258, 'Etiology', 'n.', 'The science of causes. Same as /tiology.'),
(26259, 'Etnean', 'a.', 'Pertaining to Etna, a volcanic mountain in Sicily.'),
(26260, 'Etoile', 'n.', 'See Estoile.'),
(26261, 'Etrurian', 'a.', 'Of or relating to ancient Etruria, in Italy.'),
(26262, 'Etrurian', 'n.', 'A native or inhabitant of ancient Etruria.'),
(26263, 'Etruscan', 'n.', 'Of or relating to Etruria.'),
(26264, 'Etruscan', 'n.', 'A native or inhabitant of Etruria.'),
(26265, 'Ettin', 'n.', 'A giant.'),
(26266, 'Ettle', 'v. t.', 'To earn. [Obs.] See Addle, to earn.'),
(26267, 'Etude', 'n.', 'A composition in the fine arts which is intended, or may\n   serve, for a study.'),
(26268, 'Etude', 'n.', 'A study; an exercise; a piece for practice of some special\n   point of technical execution.'),
(26269, 'Etwee', 'n.', 'See Etui.'),
(26270, 'Etymic', 'a.', 'Relating to the etymon; as, an etymic word.'),
(26271, 'Etymons', 'pl. ', 'of Etymon'),
(26272, 'Etyma', 'pl. ', 'of Etymon'),
(26273, 'Etymon', 'n.', 'An original form; primitive word; root.'),
(26274, 'Etymon', 'n.', 'Original or fundamental signification.'),
(26275, 'Etypical', 'a.', 'Diverging from, or lacking conformity to, a type.'),
(26276, 'Eucalyn', 'n.', 'An unfermentable sugar, obtained as an uncrystallizable\n   sirup by the decomposition of melitose; also obtained from a Tasmanian\n   eucalyptus, -- whence its name.'),
(26277, 'Eucharis', 'n.', 'A genus of South American amaryllidaceous plants with\n   large and beautiful white blossoms.'),
(26278, 'Euchite', 'n.', 'One who resolves religion into prayer.'),
(26279, 'Euchre', 'n.', 'A game at cards, that may be played by two, three, or four\n   persons, the highest card (except when an extra card called the Joker\n   is used) being the knave of the same suit as the trump, and called\n   right bower, the lowest card used being the seven, or frequently, in\n   two-handed euchre, the nine spot. See Bower.'),
(26280, 'Euchre', 'v. t.', 'To defeat, in a game of euchre, the side that named the\n   trump.'),
(26281, 'Euchre', 'v. t.', 'To defeat or foil thoroughly in any scheme.'),
(26282, 'Euchroic', 'a.', 'Having a fine color.'),
(26283, 'Euchrone', 'n.', 'A substance obtained from euchroic acid. See Eychroic.'),
(26284, 'Euchymy', 'n.', 'A good state of the blood and other fluids of the body.'),
(26285, 'Euclase', 'n.', 'A brittle gem occurring in light green, transparent\n   crystals, affording a brilliant clinodiagonal cleavage. It is a\n   silicate of alumina and glucina.'),
(26286, 'Euclid', 'n.', 'A Greek geometer of the 3d century b. c.; also, his\n   treatise on geometry, and hence, the principles of geometry, in\n   general.'),
(26287, 'Eucrasy', '', 'Such a due mixture of qualities in bodies as constitutes\n   health or soundness.'),
(26288, 'Euctical', '', 'Expecting a wish; supplicatory.'),
(26289, 'Eudemon', 'n.', 'Alt. of Eudaemon'),
(26290, 'Eudaemon', 'n.', 'A good angel.'),
(26291, 'Eudoxian', 'n.', 'A follower of Eudoxius, patriarch of Antioch and\n   Constantinople in the 4th century, and a celebrated defender of the\n   doctrines of Arius.'),
(26292, 'Eugenia', 'n.', 'A genus of myrtaceous plants, mostly of tropical\n   countries, and including several aromatic trees and shrubs, among which\n   are the trees which produce allspice and cloves of commerce.'),
(26293, 'Eugenic', 'a.', 'Pertaining to, or derived from, cloves; as, eugenic acid.'),
(26294, 'Eugenic', 'a.', 'Well-born; of high birth.'),
(26295, 'Eugenics', 'n.', 'The science of improving stock, whether human or animal.'),
(26296, 'Eugenin', 'n.', 'A colorless, crystalline substance extracted from oil of\n   cloves; -- called also clove camphor.'),
(26297, 'Eugenol', 'n.', 'A colorless, aromatic, liquid hydrocarbon, C10H12O2\n   resembling the phenols, and hence also called eugenic acid. It is found\n   in the oils of pimento and cloves.'),
(26298, 'Eugeny', '', 'Nobleness of birth.'),
(26299, 'Eugetic', 'a.', 'Alt. of Eugetinic'),
(26300, 'Eugubian', 'a.', 'Alt. of Eugubine'),
(26301, 'Eugubine', 'a.', 'Of or pertaining to the ancient town of Eugubium (now\n   Gubbio); as, the Eugubine tablets, or tables, or inscriptions.'),
(26302, 'Eulachon', 'n.', 'The candlefish. [Written also oulachan, oolacan, and\n   ulikon.] See Candlefish.'),
(26303, 'Eulerian', 'a.', 'Pertaining to Euler, a German mathematician of the 18th\n   century.'),
(26304, 'Eulogic', 'a.', 'Alt. of Eulogical'),
(26305, 'Eulogist', 'n.', 'One who eulogizes or praises; panegyrist; encomiast.'),
(26306, 'Eulogium', 'n.', 'A formal eulogy.'),
(26307, 'Eulogize', 'v. t.', 'To speak or write in commendation of (another); to\n   extol in speech or writing; to praise.'),
(26308, 'Eulogies', 'pl. ', 'of Eulogy'),
(26309, 'Eulogy', 'n.', 'A speech or writing in commendation of the character or\n   services of a person; as, a fitting eulogy to worth.'),
(26310, 'Eulytite', 'n.', 'A mineral, consisting chiefly of the silicate of bismuth,\n   found at Freiberg; -- called also culytine.'),
(26311, 'Eumolpus', 'n.', 'A genus of small beetles, one species of which (E. viti)\n   is very injurious to the vines in the wine countries of Europe.'),
(26312, 'Eunomian', 'n.', 'A follower of Eunomius, bishop of Cyzicus (4th century A.\n   D.), who held that Christ was not God but a created being, having a\n   nature different from that of the Father.'),
(26313, 'Eunomian', 'a.', 'Of or pertaining to Eunomius or his doctrine.'),
(26314, 'Eunomy', 'n.', 'Equal law, or a well-adjusted constitution of government.'),
(26315, 'Eunuch', 'n.', 'A male of the human species castrated; commonly, one of a\n   class of such persons, in Oriental countries, having charge of the\n   women\'s apartments. Some of them, in former times, gained high official\n   rank.'),
(26316, 'Eunuch', 'v. t.', 'Alt. of Eunuchate'),
(26317, 'Euonymin', 'n.', 'A principle or mixture of principles derived from\n   Euonymus atropurpureus, or spindle tree.'),
(26318, 'Euonymus', 'n.', 'A genus of small European and American trees; the spindle\n   tree. The bark is used as a cathartic.'),
(26319, 'Eupathy', 'n.', 'Right feeling.'),
(26320, 'Eupatrid', 'n.', 'One well born, or of noble birth.'),
(26321, 'Eupepsia', 'n.', 'Alt. of Eupepsy'),
(26322, 'Eupepsy', 'n.', 'Soundness of the nutritive or digestive organs; good\n   concoction or digestion; -- opposed to dyspepsia.'),
(26323, 'Eupeptic', 'a.', 'Of or pertaining to good digestion; easy of digestion;\n   having a good digestion; as, eupeptic food; an eupeptic man.'),
(26324, 'Euphonic', 'a.', 'Alt. of Euphonical'),
(26325, 'Euphonon', 'n.', 'An instrument resembling the organ in tine and the\n   upright piano in form. It is characterized by great strength and\n   sweetness of tone.'),
(26326, 'Euphony', 'n.', 'A pleasing or sweet sound; an easy, smooth enunciation of\n   sounds; a pronunciation of letters and syllables which is pleasing to\n   the ear.'),
(26327, 'Euphrasy', 'n.', 'The plant eyesight (euphrasia officionalis), formerly\n   regarded as beneficial in disorders of the eyes.'),
(26328, 'Euphroe', 'n.', 'A block or long slat of wood, perforated for the passage\n   of the crowfoot, or cords by which an awning is held up.'),
(26329, 'Euphuism', 'n.', 'An affectation of excessive elegance and refinement of\n   language; high-flown diction.'),
(26330, 'Euphuist', 'n.', 'One who affects excessive refinement and elegance of\n   language; -- applied esp. to a class of writers, in the age of\n   Elizabeth, whose productions are marked by affected conceits and\n   high-flown diction.'),
(26331, 'Euphuize', 'v. t.', 'To affect excessive refinement in language; to be\n   overnice in expression.'),
(26332, 'Eupione', 'n.', 'A limpid, oily liquid obtained by the destructive\n   distillation of various vegetable and animal substances; --\n   specifically, an oil consisting largely of the higher hydrocarbons of\n   the paraffin series.'),
(26333, 'Eupnaea', 'n.', 'Normal breathing where arterialization of the blood is\n   normal, in distinction from dyspnaea, in which the blood is\n   insufficiently arterialized.'),
(26334, 'Eupryion', 'n.', 'A contrivance for obtaining a light instantaneous, as a\n   lucifer match.'),
(26335, 'Eurasian', 'n.', 'A child of a European parent on the one side and an\n   Asiatic on the other.'),
(26336, 'Eurasian', 'n.', 'One born of European parents in Asia.'),
(26337, 'Eurasian', 'a.', 'Of European and Asiatic descent; of or pertaining to both\n   Europe and Asia; as, the great Eurasian plain.'),
(26338, 'Eureka', '', 'The exclamation attributed to Archimedes, who is said to have\n   cried out \"Eureka! eureka!\" (I have found it! I have found it!), upon\n   suddenly discovering a method of finding out how much the gold of King\n   Hiero\'s crown had been alloyed. Hence, an expression of triumph\n   concerning a discovery.'),
(26339, 'Euripize', 'v. t.', 'To whirl hither and thither.'),
(26340, 'Euripus', 'n.', 'A strait; a narrow tract of water, where the tide, or a\n   current, flows and reflows with violence, as the ancient fright of this\n   name between Eubaea and Baeotia. Hence, a flux and reflux.'),
(26341, 'Euritte', 'n.', 'A compact feldspathic rock; felsite. See Felsite.'),
(26342, 'Euritic', 'a.', 'Of or pelating to eurite.'),
(26343, 'European', 'a.', 'Of or pertaining to Europe, or to its inhabitants.'),
(26344, 'European', 'n.', 'A native or an inhabitant of Europe.'),
(26345, 'Eurus', 'n.', 'The east wind.'),
(26346, 'Euryale', 'n.', 'A genus of water lilies, growing in India and China. The\n   only species (E. ferox) is very prickly on the peduncles and calyx. The\n   rootstocks and seeds are used as food.'),
(26347, 'Euryale', 'n.', 'A genus of ophiurans with much-branched arms.'),
(26348, 'Eurythmy', 'n.', 'Just or harmonious proportion or movement, as in the\n   composition of a poem, an edifice, a painting, or a statue.'),
(26349, 'Eurythmy', 'n.', 'Regularly of the pulse.'),
(26350, 'Eusebian', 'n.', 'A follower of Eusebius, bishop of Caesarea, who was a\n   friend and protector of Arius.'),
(26351, 'Eustyle', 'n.', 'See Intercolumnlation.'),
(26352, 'Eutaxy', 'n.', 'Good or established order or arrangement.'),
(26353, 'Euterpe', '', 'The Muse who presided over music.'),
(26354, 'Euterpe', '', 'A genus of palms, some species of which are elegant trees.'),
(26355, 'Eutrophy', 'n.', 'Healthy nutrition; soundless as regards the nutritive\n   functions.'),
(26356, 'Euxenite', 'n.', 'A brownish black mineral with a metallic luster, found in\n   Norway. It contains niobium, titanium, yttrium, and uranium, with some\n   other metals.'),
(26357, 'Evacate', 'v. t.', 'To empty.'),
(26358, 'Evacuant', 'a.', 'Emptying; evacuative; purgative; cathartic.'),
(26359, 'Evacuant', 'n.', 'A purgative or cathartic.'),
(26360, 'Evacuate', 'v. t.', 'To make empty; to empty out; to remove the contents\n   of; as, to evacuate a vessel or dish.'),
(26361, 'Evacuate', 'v. t.', 'Fig.: To make empty; to deprive.'),
(26362, 'Evacuate', 'v. t.', 'To remove; to eject; to void; to discharge, as the\n   contents of a vessel, or of the bowels.'),
(26363, 'Evacuate', 'v. t.', 'To withdraw from; to quit; to retire from; as,\n   soldiers from a country, city, or fortress.'),
(26364, 'Evacuate', 'v. t.', 'To make void; to nullify; to vacate; as, to evacuate a\n   contract or marriage.'),
(26365, 'Evacuate', 'v. i.', 'To let blood'),
(26366, 'Evaded', 'imp. & p. p.', 'of Evade'),
(26367, 'Evading', 'p. pr. & vb. n.', 'of Evade'),
(26368, 'Evade', 'v. t.', 'To get away from by artifice; to avoid by dexterity,\n   subterfuge, address, or ingenuity; to elude; to escape from cleverly;\n   as, to evade a blow, a pursuer, a punishment; to evade the force of an\n   argument.'),
(26369, 'Evade', 'v. t.', 'To escape; to slip away; -- sometimes with from.'),
(26370, 'Evade', 'v. t.', 'To attempt to escape; to practice artifice or sophistry,\n   for the purpose of eluding.'),
(26371, 'Evadible', 'a.', 'Capable of being evaded.'),
(26372, 'Evaluate', 'v. t.', 'To fix the value of; to rate; to appraise.'),
(26373, 'Evanesce', 'v. i.', 'To vanish away; to become dissipated and disappear,\n   like vapor.'),
(26374, 'Evangel', 'n.', 'Good news; announcement of glad tidings; especially, the\n   gospel, or a gospel.'),
(26375, 'Evangely', 'n.', 'Evangel.'),
(26376, 'Evangile', 'n.', 'Good tidings; evangel.'),
(26377, 'Evanid', 'a.', 'Liable to vanish or disappear; faint; weak; evanescent; as,\n   evanid color.'),
(26378, 'Evanish', 'v. i.', 'To vanish.'),
(26379, 'Evasible', 'a.', 'That may be evaded.'),
(26380, 'Evasion', 'n.', 'The act of eluding or avoiding, particularly the pressure\n   of an argument, accusation, charge, or interrogation; artful means of\n   eluding.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(26381, 'Evasive', 'a.', 'Tending to evade, or marked by evasion; elusive;\n   shuffling; avoiding by artifice.'),
(26382, 'Evectics', 'n.', 'The branch of medical science which teaches the method of\n   acquiring a good habit of body.'),
(26383, 'Evection', '', 'The act of carrying up or away; exaltation.'),
(26384, 'Evection', '', 'An inequality of the moon\'s motion is its orbit to the\n   attraction of the sun, by which the equation of the center is\n   diminished at the syzygies, and increased at the quadratures by about\n   1¡ 20\'.'),
(26385, 'Evection', '', 'The libration of the moon.'),
(26386, 'Evened', 'imp. & p. p.', 'of Even'),
(26387, 'Evening', 'p. pr. & vb. n.', 'of Even'),
(26388, 'Evene', 'v. i.', 'To happen.'),
(26389, 'Evener', 'n.', 'One who, or that which makes even.'),
(26390, 'Evener', 'n.', 'In vehicles, a swinging crossbar, to the ends of which\n   other crossbars, or whiffletrees, are hung, to equalize the draught\n   when two or three horses are used abreast.'),
(26391, 'Evenfall', 'n.', 'Beginning of evening.'),
(26392, 'Evenhand', 'n.', 'Equality.'),
(26393, 'Evening', 'n.', 'The latter part and close of the day, and the beginning of\n   darkness or night; properly, the decline of the day, or of the sum.'),
(26394, 'Evening', 'n.', 'The latter portion, as of life; the declining period, as\n   of strength or glory.'),
(26395, 'Evenly', 'adv.', 'With an even, level, or smooth surface; without\n   roughness, elevations, or depression; uniformly; equally; comfortably;\n   impartially; serenely.'),
(26396, 'Evenness', 'n.', 'The state of being ven, level, or disturbed; smoothness;\n   horizontal position; uniformity; impartiality; calmness; equanimity;\n   appropriate place or level; as, evenness of surface, of a fluid at\n   rest, of motion, of dealings, of temper, of condition.'),
(26397, 'Evensong', 'n.', 'A song for the evening; the evening service or form of\n   worship (in the Church of England including vespers and compline);\n   also, the time of evensong.'),
(26398, 'Event', 'n.', 'That which comes, arrives, or happens; that which falls out;\n   any incident, good or bad.'),
(26399, 'Event', 'n.', 'An affair in hand; business; enterprise.'),
(26400, 'Event', 'n.', 'The consequence of anything; the issue; conclusion; result;\n   that in which an action, operation, or series of operations,\n   terminates.'),
(26401, 'Event', 'v. t.', 'To break forth.'),
(26402, 'Eventful', 'a.', 'Full of, or rich in, events or incidents; as, an eventful\n   journey; an eventful period of history; an eventful period of life.'),
(26403, 'Eventide', 'n.', 'The time of evening; evening.'),
(26404, 'Everich', 'a.', 'Alt. of Everych'),
(26405, 'Everych', 'a.', 'each one; every one; each of two. See Every.'),
(26406, 'Evermore', 'adv.', 'During eternity; always; forever; for an indefinite\n   period; at all times; -- often used substantively with for.'),
(26407, 'Evernic', 'a.', 'Pertaining to Evernia, a genus of lichens; as, evernic\n   acid.'),
(26408, 'Everse', 'v. t.', 'To overthrow or subvert.'),
(26409, 'Eversion', 'n.', 'The act of eversing; destruction.'),
(26410, 'Eversion', 'n.', 'The state of being turned back or outward; as, eversion\n   of eyelids; ectropium.'),
(26411, 'Eversive', 'a.', 'Tending to evert or overthrow; subversive; with of.'),
(26412, 'Everted', 'imp. & p. p.', 'of Evert'),
(26413, 'Everting', 'p. pr. & vb. n.', 'of Evert'),
(26414, 'Evert', 'v. t.', 'To overthrow; to subvert.'),
(26415, 'Evert', 'v. t.', 'To turn outwards, or inside out, as an intestine.'),
(26416, 'Every', 'a. & a. pron.', 'All the parts which compose a whole collection or\n   aggregate number, considered in their individuality, all taken\n   separately one by one, out of an indefinite bumber.'),
(26417, 'Every', 'a. & a. pron.', 'Every one. Cf.'),
(26418, 'Everyday', 'a.', 'Used or fit for every day; common; usual; as, an everyday\n   suit or clothes.'),
(26419, 'Everyone', 'n.', 'Everybody; -- commonly separated, every one.'),
(26420, 'Evesdrop', 'v. i.', 'See Eavesdrop.'),
(26421, 'Evibrate', 'v. t. & i.', 'To vibrate.'),
(26422, 'Evicted', 'imp. & p. p.', 'of Evict'),
(26423, 'Evicting', 'p. pr. & vb. n.', 'of Evict'),
(26424, 'Evict', 'v. t.', 'To dispossess by a judicial process; to dispossess by\n   paramount right or claim of such right; to eject; to oust.'),
(26425, 'Evict', 'v. t.', 'To evince; to prove.'),
(26426, 'Eviction', 'n.', 'The act or process of evicting; or state of being\n   evicted; the recovery of lands, tenements, etc., from another\'s\n   possession by due course of law; dispossession by paramount title or\n   claim of such title; ejectment; ouster.'),
(26427, 'Eviction', 'n.', 'Conclusive evidence; proof.'),
(26428, 'Evidence', 'n.', 'That which makes evident or manifest; that which\n   furnishes, or tends to furnish, proof; any mode of proof; the ground of\n   belief or judgement; as, the evidence of our senses; evidence of the\n   truth or falsehood of a statement.'),
(26429, 'Evidence', 'n.', 'One who bears witness.'),
(26430, 'Evidence', 'n.', 'That which is legally submitted to competent tribunal, as\n   a means of ascertaining the truth of any alleged matter of fact under\n   investigation before it; means of making proof; -- the latter, strictly\n   speaking, not being synonymous with evidence, but rather the effect of\n   it.'),
(26431, 'Evidence', 'v. t.', 'To render evident or clear; to prove; to evince; as,\n   to evidence a fact, or the guilt of an offender.'),
(26432, 'Evident', 'a.', 'Clear to the vision; especially, clear to the\n   understanding, and satisfactory to the judgment; as, the figure or\n   color of a body is evident to the senses; the guilt of an offender can\n   not always be made evident.'),
(26433, 'Evil eye', '', 'See Evil eye under Evil, a.'),
(26434, 'Evilly', 'adv.', 'In an evil manner; not well; ill.'),
(26435, 'Evilness', 'n.', 'The condition or quality of being evil; badness;\n   viciousness; malignity; vileness; as, evilness of heart; the evilness\n   of sin.'),
(26436, 'Evinced', 'imp. & p. p.', 'of Evince'),
(26437, 'Evincing', 'p. pr. & vb. n.', 'of Evince'),
(26438, 'Evince', 'v. t.', 'To conquer; to subdue.'),
(26439, 'Evince', 'v. t.', 'To show in a clear manner; to prove beyond any\n   reasonable doubt; to manifest; to make evident; to bring to light; to\n   evidence.'),
(26440, 'Evincive', 'a.', 'Tending to prove; having the power to demonstrate;\n   demonstrative; indicative.'),
(26441, 'Evirate', 'v. t.', 'To emasculate; to dispossess of manhood.'),
(26442, 'Evitable', 'a.', 'Avoidable.'),
(26443, 'Evitate', 'v. t.', 'To shun; to avoid.'),
(26444, 'Evite', 'v. t.', 'To shun.'),
(26445, 'Evocate', 'v. t.', 'To call out or forth; to summon; to evoke.'),
(26446, 'Evocator', 'n.', 'One who calls forth.'),
(26447, 'Evoked', 'imp. & p. p.', 'of Evoke'),
(26448, 'Evoking', 'p. pr. & vb. n.', 'of Evoke'),
(26449, 'Evoke', 'v. t.', 'To call out; to summon forth.'),
(26450, 'Evoke', 'v. t.', 'To call away; to remove from one tribunal to another.'),
(26451, 'Evolatic', 'a.', 'Alt. of Evolatical'),
(26452, 'Evolute', 'n.', 'A curve from which another curve, called the involute or\n   evolvent, is described by the end of a thread gradually wound upon the\n   former, or unwound from it. See Involute. It is the locus of the\n   centers of all the circles which are osculatory to the given curve or\n   evolvent.'),
(26453, 'Evolved', 'imp. & p. p.', 'of Evolve'),
(26454, 'Evolving', 'p. pr. & vb. n.', 'of Evolve'),
(26455, 'Evolve', 'v. t.', 'To unfold or unroll; to open and expand; to disentangle\n   and exhibit clearly and satisfactorily; to develop; to derive; to\n   educe.'),
(26456, 'Evolve', 'v. t.', 'To throw out; to emit; as, to evolve odors.'),
(26457, 'Evolve', 'v. i.', 'To become open, disclosed, or developed; to pass through\n   a process of evolution.'),
(26458, 'Evolvent', 'n.', 'The involute of a curve. See Involute, and Evolute.'),
(26459, 'Evomit', 'v. t.', 'To vomit.'),
(26460, 'Evulgate', 'v. t.', 'To publish abroad.'),
(26461, 'Evulsion', 'n.', 'The act of plucking out; a rooting out.'),
(26462, 'Ewery', 'n.', 'Alt. of Ewry'),
(26463, 'Exact', 'a.', 'Precisely agreeing with a standard, a fact, or the truth;\n   perfectly conforming; neither exceeding nor falling short in any\n   respect; true; correct; precise; as, the clock keeps exact time; he\n   paid the exact debt; an exact copy of a letter; exact accounts.'),
(26464, 'Exact', 'a.', 'Habitually careful to agree with a standard, a rule, or a\n   promise; accurate; methodical; punctual; as, a man exact in observing\n   an appointment; in my doings I was exact.'),
(26465, 'Exact', 'a.', 'Precisely or definitely conceived or stated; strict.'),
(26466, 'Exacted', 'imp. & p. p.', 'of Exact'),
(26467, 'Exacting', 'p. pr. & vb. n.', 'of Exact'),
(26468, 'Exact', 'a.', 'To demand or require authoritatively or peremptorily, as a\n   right; to enforce the payment of, or a yielding of; to compel to yield\n   or to furnish; hence, to wrest, as a fee or reward when none is due; --\n   followed by from or of before the one subjected to exaction; as, to\n   exact tribute, fees, obedience, etc., from or of some one.'),
(26469, 'Exact', 'v. i.', 'To practice exaction.'),
(26470, 'Exacter', 'n.', 'An exactor.'),
(26471, 'Exacting', 'a.', 'Oppressive or unreasonably severe in making demands or\n   requiring the exact fulfillment of obligations; harsh; severe.'),
(26472, 'Exaction', 'n.', 'The act of demanding with authority, and compelling to\n   pay or yield; compulsion to give or furnish; a levying by force; a\n   driving to compliance; as, the exaction to tribute or of obedience;\n   hence, extortion.'),
(26473, 'Exaction', 'n.', 'That which is exacted; a severe tribute; a fee, reward,\n   or contribution, demanded or levied with severity or injustice.'),
(26474, 'Exactly', 'adv.', 'In an exact manner; precisely according to a rule,\n   standard, or fact; accurately; strictly; correctly; nicely.'),
(26475, 'Exactor', 'n.', 'One who exacts or demands by authority or right; hence, an\n   extortioner; also, one unreasonably severe in injunctions or demands.'),
(26476, 'Exacuate', 'v. t.', 'To whet or sharpen.'),
(26477, 'Exalted', 'imp. & p. p.', 'of Exalt'),
(26478, 'Exalting', 'p. pr. & vb. n.', 'of Exalt'),
(26479, 'Exalt', 'v. t.', 'To raise high; to elevate; to lift up.'),
(26480, 'Exalt', 'v. t.', 'To elevate in rank, dignity, power, wealth, character, or\n   the like; to dignify; to promote; as, to exalt a prince to the throne,\n   a citizen to the presidency.'),
(26481, 'Exalt', 'v. t.', 'To elevate by prise or estimation; to magnify; to extol;\n   to glorify.'),
(26482, 'Exalt', 'v. t.', 'To lift up with joy, pride, or success; to inspire with\n   delight or satisfaction; to elate.'),
(26483, 'Exalt', 'v. t.', 'To elevate the tone of, as of the voice or a musical\n   instrument.'),
(26484, 'Exalt', 'v. t.', 'To render pure or refined; to intensify or concentrate;\n   as, to exalt the juices of bodies.'),
(26485, 'Exaltate', 'a.', 'Exercising its highest influence; -- said of a planet.'),
(26486, 'Exalted', 'a.', 'Raised to lofty height; elevated; extolled; refined;\n   dignified; sublime.'),
(26487, 'Exalter', 'n.', 'One who exalts or raises to dignity.'),
(26488, 'Examen', 'a.', 'Examination; inquiry.'),
(26489, 'Examined', 'imp. & p. p.', 'of Examine'),
(26490, 'Examine', 'v. t.', 'To test by any appropriate method; to inspect carefully\n   with a view to discover the real character or state of; to subject to\n   inquiry or inspection of particulars for the purpose of obtaining a\n   fuller insight into the subject of examination, as a material\n   substance, a fact, a reason, a cause, the truth of a statement; to\n   inquire or search into; to explore; as, to examine a mineral; to\n   examine a ship to know whether she is seaworthy; to examine a\n   proposition, theory, or question.'),
(26491, 'Examine', 'v. t.', 'To interrogate as in a judicial proceeding; to try or\n   test by question; as, to examine a witness in order to elicit\n   testimony, a student to test his qualifications, a bankrupt touching\n   the state of his property, etc.'),
(26492, 'Examinee', 'n.', 'A person examined.'),
(26493, 'Examiner', 'n.', 'One who examines, tries, or inspects; one who\n   interrogates; an officer or person charged with the duty of making an\n   examination; as, an examiner of students for a degree; an examiner in\n   chancery, in the patent office, etc.'),
(26494, 'Example', 'n.', 'One or a portion taken to show the character or quality of\n   the whole; a sample; a specimen.'),
(26495, 'Example', 'n.', 'That which is to be followed or imitated as a model; a\n   pattern or copy.'),
(26496, 'Example', 'n.', 'That which resembles or corresponds with something else; a\n   precedent; a model.'),
(26497, 'Example', 'n.', 'That which is to be avoided; one selected for punishment\n   and to serve as a warning; a warning.'),
(26498, 'Example', 'n.', 'An instance serving for illustration of a rule or precept,\n   especially a problem to be solved, or a case to be determined, as an\n   exercise in the application of the rules of any study or branch of\n   science; as, in trigonometry and grammar, the principles and rules are\n   illustrated by examples.'),
(26499, 'Exampled', 'imp. & p. p.', 'of Example'),
(26500, 'Example', 'v. t.', 'To set an example for; to give a precedent for; to\n   exemplify; to give an instance of; to instance.'),
(26501, 'Exampler', 'n.', 'A pattern; an exemplar.'),
(26502, 'Exanthem', 'n.', 'Same as Exanthema.'),
(26503, 'Exarate', 'v. t.', 'To plow up; also, to engrave; to write.'),
(26504, 'Exarch', 'n.', 'A viceroy; in Ravenna, the title of the viceroys of the\n   Byzantine emperors; in the Eastern Church, the superior over several\n   monasteries; in the modern Greek Church, a deputy of the patriarch ,\n   who visits the clergy, investigates ecclesiastical cases, etc.'),
(26505, 'Excamb', 'v. t.', 'Alt. of Excambie'),
(26506, 'Excambie', 'v. t.', 'To exchange; -- used with reference to transfers of\n   land.'),
(26507, 'Excavate', 'v. t.', 'To hollow out; to form cavity or hole in; to make\n   hollow by cutting, scooping, or digging; as, to excavate a ball; to\n   excavate the earth.'),
(26508, 'Excavate', 'v. t.', 'To form by hollowing; to shape, as a cavity, or\n   anything that is hollow; as, to excavate a canoe, a cellar, a channel.'),
(26509, 'Excavate', 'v. t.', 'To dig out and remove, as earth.'),
(26510, 'Excave', 'v. t.', 'To excavate.'),
(26511, 'Excecate', 'v. t.', 'To blind.'),
(26512, 'Excedent', 'v. t.', 'Excess.'),
(26513, 'Exceeded', 'imp. & p. p.', 'of Exceed'),
(26514, 'Exceed', 'v. t.', 'To go beyond; to proceed beyond the given or supposed\n   limit or measure of; to outgo; to surpass; -- used both in a good and a\n   bad sense; as, one man exceeds another in bulk, stature, weight, power,\n   skill, etc.; one offender exceeds another in villainy; his rank exceeds\n   yours.'),
(26515, 'Exceed', 'v. i.', 'To go too far; to pass the proper bounds or measure.'),
(26516, 'Exceed', 'v. i.', 'To be more or greater; to be paramount.'),
(26517, 'Exceeder', 'n.', 'One who exceeds.'),
(26518, 'Excelled', 'imp. & p. p.', 'of Excel'),
(26519, 'Excel', 'v. t.', 'To go beyond or surpass in good qualities or laudable\n   deeds; to outdo or outgo, in a good sense.'),
(26520, 'Excel', 'v. t.', 'To exceed or go beyond; to surpass.'),
(26521, 'Excel', 'v. i.', 'To surpass others in good qualities, laudable actions, or\n   acquirements; to be distinguished by superiority; as, to excel in\n   mathematics, or classics.'),
(26522, 'Excepted', 'imp. & p. p.', 'of Except'),
(26523, 'Except', 'v. t.', 'To take or leave out (anything) from a number or a whole\n   as not belonging to it; to exclude; to omit.'),
(26524, 'Except', 'v. t.', 'To object to; to protest against.'),
(26525, 'Except', 'v. i.', 'To take exception; to object; -- usually followed by to,\n   sometimes by against; as, to except to a witness or his testimony.'),
(26526, 'Except', 'prep.', 'With exclusion of; leaving or left out; excepting.'),
(26527, 'Except', 'conj.', 'Unless; if it be not so that.'),
(26528, 'Exceptor', 'n.', 'One who takes exceptions.'),
(26529, 'Excern', 'v. t.', 'To excrete; to throw off through the pores; as, fluids\n   are excerned in perspiration.'),
(26530, 'Excerp', 'a.', 'To pick out.'),
(26531, 'Excerpt', 'v. t.', 'To select; to extract; to cite; to quote.'),
(26532, 'Excerpt', 'n.', 'An extract; a passage selected or copied from a book or\n   record.'),
(26533, 'Excess', 'n.', 'The state of surpassing or going beyond limits; the being\n   of a measure beyond sufficiency, necessity, or duty; that which exceeds\n   what is usual or prover; immoderateness; superfluity; superabundance;\n   extravagance; as, an excess of provisions or of light.'),
(26534, 'Excess', 'n.', 'An undue indulgence of the appetite; transgression of\n   proper moderation in natural gratifications; intemperance; dissipation.'),
(26535, 'Excess', 'n.', 'The degree or amount by which one thing or number exceeds\n   another; remainder; as, the difference between two numbers is the\n   excess of one over the other.'),
(26536, 'Exchange', 'n.', 'The act of giving or taking one thing in return for\n   another which is regarded as an equivalent; as, an exchange of cattle\n   for grain.'),
(26537, 'Exchange', 'n.', 'The act of substituting one thing in the place of\n   another; as, an exchange of grief for joy, or of a scepter for a sword,\n   and the like; also, the act of giving and receiving reciprocally; as,\n   an exchange of civilities or views.'),
(26538, 'Exchange', 'n.', 'The thing given or received in return; esp., a\n   publication exchanged for another.'),
(26539, 'Exchange', 'n.', 'The process of setting accounts or debts between parties\n   residing at a distance from each other, without the intervention of\n   money, by exchanging orders or drafts, called bills of exchange. These\n   may be drawn in one country and payable in another, in which case they\n   are called foreign bills; or they may be drawn and made payable in the\n   same country, in which case they are called inland bills. The term bill\n   of exchange is often abbreviated into exchange; as, to buy or sell\n   exchange.'),
(26540, 'Exchange', 'n.', 'A mutual grant of equal interests, the one in\n   consideration of the other. Estates exchanged must be equal in\n   quantity, as fee simple for fee simple.'),
(26541, 'Exchange', 'n.', 'The place where the merchants, brokers, and bankers of a\n   city meet at certain hours, to transact business. In this sense often\n   contracted to \'Change.'),
(26542, 'Exchange', 'n.', 'To part with give, or transfer to another in\n   consideration of something received as an equivalent; -- usually\n   followed by for before the thing received.'),
(26543, 'Exchange', 'n.', 'To part with for a substitute; to lay aside, quit, or\n   resign (something being received in place of the thing parted with);\n   as, to exchange a palace for cell.'),
(26544, 'Exchange', 'n.', 'To give and receive reciprocally, as things of the same\n   kind; to barter; to swap; as, to exchange horses with a neighbor; to\n   exchange houses or hats.'),
(26545, 'Exchange', 'v. i.', 'To be changed or received in exchange for; to pass in\n   exchange; as, dollar exchanges for ten dimes.'),
(26546, 'Excheat', 'n.', 'See Escheat.'),
(26547, 'Excide', 'v. t.', 'To cut off.'),
(26548, 'Exciple', 'n.', 'Alt. of Excipulum'),
(26549, 'Excise', 'n.', 'In inland duty or impost operating as an indirect tax on\n   the consumer, levied upon certain specified articles, as, tobacco, ale,\n   spirits, etc., grown or manufactured in the country. It is also levied\n   to pursue certain trades and deal in certain commodities. Certain\n   direct taxes (as, in England, those on carriages, servants, plate,\n   armorial bearings, etc.), are included in the excise. Often used\n   adjectively; as, excise duties; excise law; excise system.'),
(26550, 'Excise', 'n.', 'That department or bureau of the public service charged\n   with the collection of the excise taxes.'),
(26551, 'Excised', 'imp. & p. p.', 'of Excise'),
(26552, 'Excising', 'p. pr. & vb. n.', 'of Excise'),
(26553, 'Excise', 'v. t.', 'To lay or impose an excise upon.'),
(26554, 'Excise', 'v. t.', 'To impose upon; to overcharge.'),
(26555, 'Excise', 'v. t.', 'To cut out or off; to separate and remove; as, to excise\n   a tumor.'),
(26556, 'Excision', 'n.', 'The act of excising or cutting out or off; extirpation;\n   destruction.'),
(26557, 'Excision', 'n.', 'The act of cutting off from the church; excommunication.'),
(26558, 'Excision', 'n.', 'The removal, especially of small parts, with a cutting\n   instrument.'),
(26559, 'Excitant', 'a.', 'Tending to excite; exciting.'),
(26560, 'Excitant', 'n.', 'An agent or influence which arouses vital activity, or\n   produces increased action, in a living organism or in any of its\n   tissues or parts; a stimulant.'),
(26561, 'Excitate', 'v. t.', 'To excite.'),
(26562, 'Excited', 'imp. & p. p.', 'of Excite'),
(26563, 'exciting', 'p. pr. & vb. n.', 'of Excite'),
(26564, 'Excite', 'v. t.', 'To call to activity in any way; to rouse to feeling; to\n   kindle to passionate emotion; to stir up to combined or general\n   activity; as, to excite a person, the spirits, the passions; to excite\n   a mutiny or insurrection; to excite heat by friction.'),
(26565, 'Excite', 'v. t.', 'To call forth or increase the vital activity of an\n   organism, or any of its parts.'),
(26566, 'Exciter', 'n.', 'One who, or that which, excites.'),
(26567, 'Exciting', 'a.', 'Calling or rousing into action; producing excitement; as,\n   exciting events; an exciting story.'),
(26568, 'Excitive', 'a.', 'Serving or tending to excite; excitative.'),
(26569, 'Excitive', 'n.', 'That which excites; an excitant.'),
(26570, 'Exclaim', 'v. t. & i.', 'To cry out from earnestness or passion; to utter\n   with vehemence; to call out or declare loudly; to protest vehemently;\n   to vociferate; to shout; as, to exclaim against oppression with wonder\n   or astonishment; \"The field is won!\" he exclaimed.'),
(26571, 'Exclaim', 'n.', 'Outcry; clamor.'),
(26572, 'Exclave', 'n.', 'A portion of a country which is separated from the main\n   part and surrounded by politically alien territory.'),
(26573, 'Excluded', 'imp. & p. p.', 'of Exclude'),
(26574, 'Exclude', 'v. t.', 'To shut out; to hinder from entrance or admission; to\n   debar from participation or enjoyment; to deprive of; to except; -- the\n   opposite to admit; as, to exclude a crowd from a room or house; to\n   exclude the light; to exclude one nation from the ports of another; to\n   exclude a taxpayer from the privilege of voting.'),
(26575, 'Exclude', 'v. t.', 'To thrust out or eject; to expel; as, to exclude young\n   animals from the womb or from eggs.'),
(26576, 'Excoct', 'v. t.', 'To boil out; to produce by boiling.'),
(26577, 'Excreate', 'v. t.', 'To spit out; to discharge from the throat by hawking\n   and spitting.'),
(26578, 'Excreta', 'n. pl.', 'Matters to be excreted.'),
(26579, 'Excreted', 'imp. & p. p.', 'of Excrete'),
(26580, 'Excrete', 'v. t.', 'To separate and throw off; to excrete urine.'),
(26581, 'Excretin', 'n.', 'A nonnitrogenous, crystalline body, present in small\n   quantity in human faeces.'),
(26582, 'Excur', 'i.', 'To run out or forth; to extend.'),
(26583, 'Excurse', 'v. t.', 'To journey or pass thought.'),
(26584, 'Excursus', 'n.', 'A dissertation or digression appended to a work, and\n   containing a more extended exposition of some important point or topic.'),
(26585, 'Excused', 'imp. & p. p.', 'of Excuse'),
(26586, 'Excusing', 'p. pr. & vb. n.', 'of Excuse'),
(26587, 'Excuse', 'v. t.', 'To free from accusation, or the imputation of fault or\n   blame; to clear from guilt; to release from a charge; to justify by\n   extenuating a fault; to exculpate; to absolve; to acquit.'),
(26588, 'Excuse', 'v. t.', 'To pardon, as a fault; to forgive entirely, or to admit\n   to be little censurable, and to overlook; as, we excuse irregular\n   conduct, when extraordinary circumstances appear to justify it.'),
(26589, 'Excuse', 'v. t.', 'To regard with indulgence; to view leniently or to\n   overlook; to pardon.'),
(26590, 'Excuse', 'v. t.', 'To free from an impending obligation or duty; hence, to\n   disengage; to dispense with; to release by favor; also, to remit by\n   favor; not to exact; as, to excuse a forfeiture.'),
(26591, 'Excuse', 'v. t.', 'To relieve of an imputation by apology or defense; to\n   make apology for as not seriously evil; to ask pardon or indulgence\n   for.'),
(26592, 'Excuse', 'v. t.', 'The act of excusing, apologizing, exculpating,\n   pardoning, releasing, and the like; acquittal; release; absolution;\n   justification; extenuation.'),
(26593, 'Excuse', 'v. t.', 'That which is offered as a reason for being excused; a\n   plea offered in extenuation of a fault or irregular deportment;\n   apology; as, an excuse for neglect of duty; excuses for delay of\n   payment.'),
(26594, 'Excuse', 'v. t.', 'That which excuses; that which extenuates or justifies a\n   fault.'),
(26595, 'Excuser', 'n.', 'One who offers excuses or pleads in extenuation of the\n   fault of another.'),
(26596, 'Excuser', 'n.', 'One who excuses or forgives another.'),
(26597, 'Excuss', 'v. t.', 'To shake off; to discard.'),
(26598, 'Excuss', 'v. t.', 'To inspect; to investigate; to decipher.'),
(26599, 'Excuss', 'v. t.', 'To seize and detain by law, as goods.'),
(26600, 'Exeat', 'n.', 'A license for absence from a college or a religious house.'),
(26601, 'Exeat', 'n.', 'A permission which a bishop grants to a priest to go out of\n   his diocese.'),
(26602, 'Execrate', 'v. t.', 'To denounce evil against, or to imprecate evil upon;\n   to curse; to protest against as unholy or detestable; hence, to detest\n   utterly; to abhor; to abominate.'),
(26603, 'Exect', 'v. t.', 'To cut off or out. [Obs.] See Exsect.'),
(26604, 'Exection', 'n.', 'See Exsection.'),
(26605, 'Executed', 'imp. & p. p.', 'of Execute'),
(26606, 'Execute', 'v. t.', 'To follow out or through to the end; to carry out into\n   complete effect; to complete; to finish; to effect; to perform.'),
(26607, 'Execute', 'v. t.', 'To complete, as a legal instrument; to perform what is\n   required to give validity to, as by signing and perhaps sealing and\n   delivering; as, to execute a deed, lease, mortgage, will, etc.'),
(26608, 'Execute', 'v. t.', 'To give effect to; to do what is provided or required\n   by; to perform the requirements or stimulations of; as, to execute a\n   decree, judgment, writ, or process.'),
(26609, 'Execute', 'v. t.', 'To infect capital punishment on; to put to death in\n   conformity to a legal sentence; as, to execute a traitor.'),
(26610, 'Execute', 'v. t.', 'Too put to death illegally; to kill.'),
(26611, 'Execute', 'v. t.', 'To perform, as a piece of music, either on an\n   instrument or with the voice; as, to execute a difficult part\n   brilliantly.'),
(26612, 'Execute', 'v. i.', 'To do one\'s work; to act one\'s part of purpose.'),
(26613, 'Execute', 'v. i.', 'To perform musically.'),
(26614, 'Executer', 'n.', 'One who performs or carries into effect. See Executor.'),
(26615, 'Executor', 'n.', 'One who executes or performs; a doer; as, an executor of\n   baseness.'),
(26616, 'Executor', 'n.', 'An executioner.'),
(26617, 'Executor', 'n.', 'The person appointed by a testator to execute his will,\n   or to see its provisions carried into effect, after his decease.'),
(26618, 'Exedent', 'a.', 'Eating out; consuming.'),
(26619, 'Exedrae', 'pl. ', 'of Exedra'),
(26620, 'Exedra', 'n.', 'A room in a public building, furnished with seats.'),
(26621, 'Exedra', 'n.', 'The projection of any part of a building in a rounded form.'),
(26622, 'Exedra', 'n.', 'Any out-of-door seat in stone, large enough for several\n   persons; esp., one of curved form.'),
(26623, 'Exegeses', 'pl. ', 'of Exegesis'),
(26624, 'Exegesis', 'n.', 'Exposition; explanation; especially, a critical\n   explanation of a text or portion of Scripture.'),
(26625, 'Exegesis', 'n.', 'The process of finding the roots of an equation.'),
(26626, 'Exegete', 'n.', 'An exegetist.'),
(26627, 'Exegetic', 'a.', 'Alt. of Exegetical'),
(26628, 'Exemplar', 'n.', 'A model, original, or pattern, to be copied or imitated;\n   a specimen; sometimes; an ideal model or type, as that which an artist\n   conceives.'),
(26629, 'Exemplar', 'n.', 'A copy of a book or writing.'),
(26630, 'Exemplar', 'a.', 'Exemplary.'),
(26631, 'Exempt', 'a.', 'Cut off; set apart.'),
(26632, 'Exempt', 'a.', 'Extraordinary; exceptional.'),
(26633, 'Exempt', 'a.', 'Free, or released, from some liability to which others are\n   subject; excepted from the operation or burden of some law; released;\n   free; clear; privileged; -- (with from): not subject to; not liable to;\n   as, goods exempt from execution; a person exempt from jury service.'),
(26634, 'Exempt', 'n.', 'One exempted or freed from duty; one not subject.'),
(26635, 'Exempt', 'n.', 'One of four officers of the Yeomen of the Royal Guard,\n   having the rank of corporal; an Exon.'),
(26636, 'Exempted', 'imp. & p. p.', 'of Exempt'),
(26637, 'Exempt', 'a.', 'To remove; to set apart.'),
(26638, 'Exempt', 'a.', 'To release or deliver from some liability which others are\n   subject to; to except or excuse from he operation of a law; to grant\n   immunity to; to free from obligation; to release; as, to exempt from\n   military duty, or from jury service; to exempt from fear or pain.'),
(26639, 'Exequial', 'a.', 'Of or pertaining to funerals; funereal.'),
(26640, 'Exequies', 'pl. ', 'of Exequy'),
(26641, 'Exequy', 'n.', 'A funeral rite (usually in the plural); the ceremonies of\n   burial; obsequies; funeral procession.'),
(26642, 'Exercent', 'a.', 'Practicing; professional.'),
(26643, 'Exercise', 'n.', 'The act of exercising; a setting in action or practicing;\n   employment in the proper mode of activity; exertion; application; use;\n   habitual activity; occupation, in general; practice.'),
(26644, 'Exercise', 'n.', 'Exertion for the sake of training or improvement whether\n   physical, intellectual, or moral; practice to acquire skill, knowledge,\n   virtue, perfectness, grace, etc.'),
(26645, 'Exercise', 'n.', 'Bodily exertion for the sake of keeping the organs and\n   functions in a healthy state; hygienic activity; as, to take exercise\n   on horseback.'),
(26646, 'Exercise', 'n.', 'The performance of an office, a ceremony, or a religious\n   duty.'),
(26647, 'Exercise', 'n.', 'That which is done for the sake of exercising,\n   practicing, training, or promoting skill, health, mental, improvement,\n   moral discipline, etc.; that which is assigned or prescribed for such\n   ends; hence, a disquisition; a lesson; a task; as, military or naval\n   exercises; musical exercises; an exercise in composition.'),
(26648, 'Exercise', 'n.', 'That which gives practice; a trial; a test.'),
(26649, 'Exercise', 'v. t.', 'To set in action; to cause to act, move, or make\n   exertion; to give employment to; to put in action habitually or\n   constantly; to school or train; to exert repeatedly; to busy.'),
(26650, 'Exercise', 'v. t.', 'To exert for the sake of training or improvement; to\n   practice in order to develop; hence, also, to improve by practice; to\n   discipline, and to use or to for the purpose of training; as, to\n   exercise arms; to exercise one\'s self in music; to exercise troops.'),
(26651, 'Exercise', 'v. t.', 'To occupy the attention and effort of; to task; to\n   tax, especially in a painful or vexatious manner; harass; to vex; to\n   worry or make anxious; to affect; to discipline; as, exercised with\n   pain.'),
(26652, 'Exercise', 'v. t.', 'To put in practice; to carry out in action; to perform\n   the duties of; to use; to employ; to practice; as, to exercise\n   authority; to exercise an office.'),
(26653, 'Exercise', 'v. i.', 'To exercise one\'s self, as under military training; to\n   drill; to take exercise; to use action or exertion; to practice\n   gymnastics; as, to exercise for health or amusement.'),
(26654, 'Exergue', 'n.', 'The small space beneath the base line of a subject\n   engraved on a coin or medal. It usually contains the date, place,\n   engraver\'s name, etc., or other subsidiary matter.'),
(26655, 'Exerted', 'imp. & p. p.', 'of Exert'),
(26656, 'Exerting', 'p. pr. & vb. n.', 'of Exert'),
(26657, 'Exert', 'v. t.', 'To thrust forth; to emit; to push out.'),
(26658, 'Exert', 'v. t.', 'To put force, ability, or anything of the nature of an\n   active faculty; to put in vigorous action; to bring into active\n   operation; as, to exert the strength of the body, limbs, faculties, or\n   imagination; to exert the mind or the voice.'),
(26659, 'Exert', 'v. t.', 'To put forth, as the result or exercise of effort; to\n   bring to bear; to do or perform.'),
(26660, 'Exertion', 'n.', 'The act of exerting, or putting into motion or action;\n   the active exercise of any power or faculty; an effort, esp. a\n   laborious or perceptible effort; as, an exertion of strength or power;\n   an exertion of the limbs or of the mind; it is an exertion for him to\n   move, to-day.'),
(26661, 'Exertive', 'a.', 'Having power or a tendency to exert; using exertion.'),
(26662, 'Exesion', 'n.', 'The act of eating out or through.'),
(26663, 'Exeunt', '', 'They go out, or retire from the scene; as, exeunt all except\n   Hamlet. See 1st Exit.'),
(26664, 'Exhalant', 'a.', 'Having the quality of exhaling or evaporating.'),
(26665, 'Exaled', 'imp. & p. p.', 'of Exhale'),
(26666, 'Exaling', 'p. pr. & vb. n.', 'of Exhale'),
(26667, 'Exhale', 'v. t.', 'To breathe out. Hence: To emit, as vapor; to send out,\n   as an odor; to evaporate; as, the earth exhales vapor; marshes exhale\n   noxious effluvia.'),
(26668, 'Exhale', 'v. t.', 'To draw out; to cause to be emitted in vapor; as, the\n   sum exhales the moisture of the earth.'),
(26669, 'Exhale', 'v. i.', 'To rise or be given off, as vapor; to pass off, or\n   vanish.'),
(26670, 'Exhaust', 'v. t.', 'To draw or let out wholly; to drain off completely; as,\n   to exhaust the water of a well; the moisture of the earth is exhausted\n   by evaporation.'),
(26671, 'Exhaust', 'v. t.', 'To empty by drawing or letting out the contents; as, to\n   exhaust a well, or a treasury.'),
(26672, 'Exhaust', 'v. t.', 'To drain, metaphorically; to use or expend wholly, or\n   till the supply comes to an end; to deprive wholly of strength; to use\n   up; to weary or tire out; to wear out; as, to exhaust one\'s strength,\n   patience, or resources.'),
(26673, 'Exhaust', 'v. t.', 'To bring out or develop completely; to discuss\n   thoroughly; as, to exhaust a subject.'),
(26674, 'Exhaust', 'v. t.', 'To subject to the action of various solvents in order\n   to remove all soluble substances or extractives; as, to exhaust a drug\n   successively with water, alcohol, and ether.'),
(26675, 'Exhaust', 'a.', 'Drained; exhausted; having expended or lost its energy.'),
(26676, 'Exhaust', 'a.', 'Pertaining to steam, air, gas, etc., that is released from\n   the cylinder of an engine after having preformed its work.'),
(26677, 'Exhaust', 'n.', 'The steam let out of a cylinder after it has done its work\n   there.'),
(26678, 'Exhaust', 'n.', 'The foul air let out of a room through a register or pipe\n   provided for the purpose.'),
(26679, 'Exhedra', 'n.', 'See Exedra.'),
(26680, 'Exhibit', 'v. t.', 'To hold forth or present to view; to produce publicly,\n   for inspection; to show, especially in order to attract notice to what\n   is interesting; to display; as, to exhibit commodities in a warehouse,\n   a picture in a gallery.'),
(26681, 'Exhibit', 'v. t.', 'To submit, as a document, to a court or officer, in\n   course of proceedings; also, to present or offer officially or in legal\n   form; to bring, as a charge.'),
(26682, 'Exhibit', 'v. t.', 'To administer as a remedy; as, to exhibit calomel.'),
(26683, 'Exhibit', 'n.', 'Any article, or collection of articles, displayed to view,\n   as in an industrial exhibition; a display; as, this exhibit was marked\n   A; the English exhibit.'),
(26684, 'Exhibit', 'n.', 'A document produced and identified in court for future use\n   as evidence.'),
(26685, 'Exhorted', 'imp. & p. p.', 'of Exhort'),
(26686, 'Exhort', 'v. t.', 'To incite by words or advice; to animate or urge by\n   arguments, as to a good deed or laudable conduct; to address\n   exhortation to; to urge strongly; hence, to advise, warn, or caution.'),
(26687, 'Exhort', 'v. i.', 'To deliver exhortation; to use words or arguments to\n   incite to good deeds.'),
(26688, 'Exhort', 'n.', 'Exhortation.'),
(26689, 'Exhorter', 'n.', 'One who exhorts or incites.'),
(26690, 'Exhumed', 'imp. & p. p.', 'of Exhume'),
(26691, 'Exhuming', 'p. pr. & vb. n.', 'of Exhume'),
(26692, 'Exhume', 'v. t.', 'To dig out of the ground; to take out of a place of\n   burial; to disinter.'),
(26693, 'Exiccate', 'v. t.', 'See Exsiccate.'),
(26694, 'Exigence', 'n.', 'Exigency.'),
(26695, 'Exigency', 'n.', 'The state of being exigent; urgent or exacting want;\n   pressing necessity or distress; need; a case demanding immediate\n   action, supply, or remedy; as, an unforeseen exigency.'),
(26696, 'Exigent', 'a.', 'Exacting or requiring immediate aid or action; pressing;\n   critical.'),
(26697, 'Exigent', 'n.', 'Exigency; pressing necessity; decisive moment.'),
(26698, 'Exigent', 'n.', 'The name of a writ in proceedings before outlawry.'),
(26699, 'Exigible', 'a.', 'That may be exacted; repairable.'),
(26700, 'Exiguity', 'n.', 'Scantiness; smallness; thinness.'),
(26701, 'Exiguous', 'a.', 'Scanty; small; slender; diminutive.'),
(26702, 'Exile', 'n.', 'Forced separation from one\'s native country; expulsion from\n   one\'s home by the civil authority; banishment; sometimes, voluntary\n   separation from one\'s native country.'),
(26703, 'Exile', 'n.', 'The person expelled from his country by authority; also, one\n   who separates himself from his home.'),
(26704, 'Exiled', 'imp. & p. p.', 'of Exile'),
(26705, 'Exiling', 'p. pr. & vb. n.', 'of Exile'),
(26706, 'Exile', 'v. t.', 'To banish or expel from one\'s own country or home; to\n   drive away.'),
(26707, 'Exile', 'a.', 'Small; slender; thin; fine.'),
(26708, 'Exilic', 'a.', 'Pertaining to exile or banishment, esp. to that of the Jews\n   in Babylon.'),
(26709, 'Exility', 'a.', 'Smallness; meagerness; slenderness; fineness, thinness.'),
(26710, 'Eximious', 'a.', 'Select; choice; hence, extraordinary, excellent.'),
(26711, 'Existed', 'imp. & p. p.', 'of Exist'),
(26712, 'Existing', 'p. pr. & vb. n.', 'of Exist'),
(26713, 'Exist', 'v. i.', 'To be as a fact and not as a mode; to have an actual or\n   real being, whether material or spiritual.'),
(26714, 'Exist', 'v. i.', 'To be manifest in any manner; to continue to be; as,\n   great evils existed in his reign.'),
(26715, 'Exist', 'v. i.', 'To live; to have life or the functions of vitality; as,\n   men can not exist water, nor fishes on land.'),
(26716, 'Existent', 'a.', 'Having being or existence; existing; being; occurring\n   now; taking place.'),
(26717, 'Exister', 'n.', 'One who exists.'),
(26718, 'Exitial', 'a.', 'Alt. of Exitious'),
(26719, 'Exitious', 'a.', 'Destructive; fatal.'),
(26720, 'Exocarp', 'n.', 'The outer portion of a fruit, as the flesh of a peach or\n   the rind of an orange. See Illust. of Drupe.'),
(26721, 'Exocetus', 'n.', 'Alt. of Exocoetus'),
(26722, 'Exode', 'n.', 'Departure; exodus; esp., the exodus of the Israelites from\n   Egypt.'),
(26723, 'Exode', 'n.', 'The final chorus; the catastrophe.'),
(26724, 'Exode', 'n.', 'An afterpiece of a comic description, either a farce or a\n   travesty.'),
(26725, 'Exodic', 'a.', 'Conducting influences from the spinal cord outward; -- said\n   of the motor or efferent nerves. Opposed to esodic.'),
(26726, 'Exogium', 'n.', 'See Exode.'),
(26727, 'Exodus', 'n.', 'A going out; particularly (the Exodus), the going out or\n   journey of the Israelites from Egypt under the conduct of Moses; and\n   hence, any large migration from a place.'),
(26728, 'Exodus', 'n.', 'The second of the Old Testament, which contains the\n   narrative of the departure of the Israelites from Egypt.'),
(26729, 'Exody', 'n.', 'Exodus; withdrawal.'),
(26730, 'Exogamy', 'n.', 'The custom, or tribal law, which prohibits marriage\n   between members of the same tribe; marriage outside of the tribe; --\n   opposed to endogamy.'),
(26731, 'Exogen', 'n.', 'A plant belonging to one of the greater part of the\n   vegetable kingdom, and which the plants are characterized by having c\n   wood bark, and pith, the wood forming a layer between the other two,\n   and increasing, if at all, by the animal addition of a new layer to the\n   outside next to the bark. The leaves are commonly netted-veined, and\n   the number of cotyledons is two, or, very rarely, several in a whorl.\n   Cf. Endogen.'),
(26732, 'Exogyra', 'n.', 'A genus of Cretaceous fossil shells allied to oysters.'),
(26733, 'Exolete', 'a.', 'Obsolete; out of use; state; insipid.'),
(26734, 'Exolve', 'v. t.', 'To loose; to pay.'),
(26735, 'Exoplasm', 'n.', 'See Ectosarc, and Ectoplasm.'),
(26736, 'Exoptile', 'n.', 'A name given by Lestiboudois to dicotyledons; -- so\n   called because the plumule is naked.'),
(26737, 'Exrable', 'a.', 'Capable of being moved by entreaty; pitiful; tender.'),
(26738, 'Exorate', 'v. t.', 'To persuade, or to gain, by entreaty.'),
(26739, 'Exorcise', 'v. t.', 'To cast out, as a devil, evil spirits, etc., by\n   conjuration or summoning by a holy name, or by certain ceremonies; to\n   expel (a demon) or to conjure (a demon) to depart out of a person\n   possessed by one.'),
(26740, 'Exorcise', 'v. t.', 'To deliver or purify from the influence of an evil\n   spirit or demon.'),
(26741, 'Exorcism', 'n.', 'The act of exorcising; the driving out of evil spirits\n   from persons or places by conjuration; also, the form of conjuration\n   used.'),
(26742, 'Exorcism', 'n.', 'Conjuration for raising spirits.'),
(26743, 'Exorcist', 'n.', 'One who expels evil spirits by conjuration or exorcism.'),
(26744, 'Exorcist', 'n.', 'A conjurer who can raise spirits.'),
(26745, 'Exordial', 'a.', 'Pertaining to the exordium of a discourse: introductory.'),
(26746, 'Exordia', 'pl. ', 'of Exordium'),
(26747, 'Exordium', 'n.', 'A beginning; an introduction; especially, the\n   introductory part of a discourse or written composition, which prepares\n   the audience for the main subject; the opening part of an oration.'),
(26748, 'Exorhiza', 'n.', 'A plant Whose radicle is not inclosed or sheathed by the\n   cotyledons or plumule.'),
(26749, 'Exortive', 'a.', 'Rising; relating to the east.'),
(26750, 'Exosmose', 'n.', 'The passage of gases, vapors, or liquids thought\n   membranes or porous media from within outward, in the phenomena of\n   osmose; -- opposed to endosmose. See Osmose.'),
(26751, 'Exospore', 'n.', 'The extreme outer wall of a spore; the epispore.'),
(26752, 'Exostome', 'n.', 'The small aperture or foremen in the outer coat of the\n   ovule of a plant.'),
(26753, 'Exoteric', 'a.', 'Alt. of Exoterical'),
(26754, 'Exotery', 'n.', 'That which is obvious, public, or common.'),
(26755, 'Exotheca', 'n.', 'The tissue which fills the interspaces between the costae\n   of many madreporarian corals, usually consisting of small transverse or\n   oblique septa.'),
(26756, 'Exotic', 'a.', 'Introduced from a foreign country; not native; extraneous;\n   foreign; as, an exotic plant; an exotic term or word.'),
(26757, 'Exotic', 'n.', 'Anything of foreign origin; something not of native growth,\n   as a plant, a word, a custom.'),
(26758, 'Exotical', 'a.', 'Foreign; not native; exotic.'),
(26759, 'Expanded', 'imp. & p. p.', 'of Expand'),
(26760, 'Expand', 'v. t.', 'To lay open by extending; to open wide; to spread out;\n   to diffuse; as, a flower expands its leaves.'),
(26761, 'Expand', 'v. t.', 'To cause the particles or parts of to spread themselves\n   or stand apart, thus increasing bulk without addition of substance; to\n   make to occupy more space; to dilate; to distend; to extend every way;\n   to enlarge; -- opposed to contract; as, to expand the chest; heat\n   expands all bodies; to expand the sphere of benevolence.'),
(26762, 'Expand', 'v. t.', 'To state in enlarged form; to develop; as, to expand an\n   equation. See Expansion, 5.'),
(26763, 'Expand', 'v. i.', 'To become widely opened, spread apart, dilated,\n   distended, or enlarged; as, flowers expand in the spring; metals expand\n   by heat; the heart expands with joy.'),
(26764, 'Expander', 'n.', 'Anything which causes expansion esp. (Mech.) a tool for\n   stretching open or expanding a tube, etc.'),
(26765, 'Expanse', 'n.', 'That which is expanded or spread out; a wide extent of\n   space or body; especially, the arch of the sky.'),
(26766, 'Expanse', 'v. t.', 'To expand.'),
(26767, 'Ex parte', '', 'Upon or from one side only; one-sided; partial; as, an ex\n   parte statement.'),
(26768, 'Expected', 'imp. & p. p.', 'of Expect'),
(26769, 'Expect', 'v. t.', 'To wait for; to await.'),
(26770, 'Expect', 'v. t.', 'To look for (mentally); to look forward to, as to\n   something that is believed to be about to happen or come; to have a\n   previous apprehension of, whether of good or evil; to look for with\n   some confidence; to anticipate; -- often followed by an infinitive,\n   sometimes by a clause (with, or without, that); as, I expect to receive\n   wages; I expect that the troops will be defeated.'),
(26771, 'Expect', 'v. t.', 'To wait; to stay.'),
(26772, 'Expect', 'n.', 'Expectation.'),
(26773, 'Expecter', 'n.', 'One who expects.'),
(26774, 'Expede', 'v. t.', 'To expedite; to hasten.'),
(26775, 'Expedite', 'a.', 'Free of impediment; unimpeded.'),
(26776, 'Expedite', 'a.', 'Expeditious; quick; speedily; prompt.'),
(26777, 'Expedite', 'v. t.', 'To relieve of impediments; to facilitate; to\n   accelerate the process or progress of; to hasten; to quicken; as, to\n   expedite the growth of plants.'),
(26778, 'Expedite', 'v. t.', 'To despatch; to send forth; to issue officially.'),
(26779, 'Expelled', 'imp. & p. p.', 'of Expel'),
(26780, 'Expel', 'v. t.', 'To drive or force out from that within which anything is\n   contained, inclosed, or situated; to eject; as to expel air from a\n   bellows.'),
(26781, 'Expel', 'v. t.', 'To drive away from one\'s country; to banish.'),
(26782, 'Expel', 'v. t.', 'To cut off from further connection with an institution of\n   learning, a society, and the like; as, to expel a student or member.'),
(26783, 'Expel', 'v. t.', 'To keep out, off, or away; to exclude.'),
(26784, 'Expel', 'v. t.', 'To discharge; to shoot.'),
(26785, 'Expeller', 'n.', 'One who, or that which, expels.'),
(26786, 'Expended', 'imp. & p. p.', 'of Expend'),
(26787, 'Expend', 'v. t.', 'To lay out, apply, or employ in any way; to consume by\n   use; to use up or distribute, either in payment or in donations; to\n   spend; as, they expend money for food or in charity; to expend time\n   labor, and thought; to expend hay in feeding cattle, oil in a lamp,\n   water in mechanical operations.'),
(26788, 'Expend', 'v. i.', 'To be laid out, used, or consumed.'),
(26789, 'Expend', 'v. i.', 'To pay out or disburse money.'),
(26790, 'Expense', 'n.', 'A spending or consuming; disbursement; expenditure.'),
(26791, 'Expense', 'n.', 'That which is expended, laid out, or consumed; cost;\n   outlay; charge; -- sometimes with the notion of loss or damage to those\n   on whom the expense falls; as, the expenses of war; an expense of time.'),
(26792, 'Expense', 'n.', 'Loss.'),
(26793, 'Expert', 'a.', 'Taught by use, practice, or experience, experienced; having\n   facility of operation or performance from practice; knowing and ready\n   from much practice; clever; skillful; as, an expert surgeon; expert in\n   chess or archery.'),
(26794, 'Expert', 'n.', 'An expert or experienced person; one instructed by\n   experience; one who has skill, experience, or extensive knowledge in\n   his calling or in any special branch of learning.'),
(26795, 'Expert', 'n.', 'A specialist in a particular profession or department of\n   science requiring for its mastery peculiar culture and erudition.'),
(26796, 'Expert', 'n.', 'A sworn appraiser.'),
(26797, 'Expert', 'v. t.', 'To experience.'),
(26798, 'Expertly', 'adv.', 'In a skillful or dexterous manner; adroitly; with\n   readiness and accuracy.'),
(26799, 'Expiable', 'a.', 'Capable of being expiated or atoned for; as, an expiable\n   offense; expiable guilt.'),
(26800, 'Expiated', 'imp. & p. p.', 'of Expiate'),
(26801, 'Expiate', 'v. t.', 'To extinguish the guilt of by sufferance of penalty or\n   some equivalent; to make complete satisfaction for; to atone for; to\n   make amends for; to make expiation for; as, to expiate a crime, a\n   guilt, or sin.'),
(26802, 'Expiate', 'v. t.', 'To purify with sacred rites.'),
(26803, 'Expiate', 'a.', 'Terminated.'),
(26804, 'Expiator', 'n.', 'One who makes expiation or atonement.'),
(26805, 'Expirant', 'n.', 'One who expires or is expiring.'),
(26806, 'Expired', 'imp. & p. p.', 'of Expire'),
(26807, 'Expiring', 'p. pr & vb. n.', 'of Expire'),
(26808, 'Expire', 'v. t.', 'To breathe out; to emit from the lungs; to throw out\n   from the mouth or nostrils in the process of respiration; -- opposed to\n   inspire.'),
(26809, 'Expire', 'v. t.', 'To give forth insensibly or gently, as a fluid or vapor;\n   to emit in minute particles; to exhale; as, the earth expires a damp\n   vapor; plants expire odors.'),
(26810, 'Expire', 'v. t.', 'To emit; to give out.'),
(26811, 'Expire', 'v. t.', 'To bring to a close; to terminate.'),
(26812, 'Expire', 'v. i.', 'To emit the breath.'),
(26813, 'Expire', 'v. i.', 'To emit the last breath; to breathe out the life; to\n   die; as, to expire calmly; to expire in agony.'),
(26814, 'Expire', 'v. i.', 'To come to an end; to cease; to terminate; to perish; to\n   become extinct; as, the flame expired; his lease expires to-day; the\n   month expired on Saturday.'),
(26815, 'Expire', 'v. i.', 'To burst forth; to fly out with a blast.'),
(26816, 'Expiring', 'a.', 'Breathing out air from the lungs; emitting fluid or\n   volatile matter; exhaling; breathing the last breath; dying; ending;\n   terminating.'),
(26817, 'Expiring', 'a.', 'Pertaining to, or uttered at, the time of dying; as,\n   expiring words; expiring groans.'),
(26818, 'Expiry', 'n.', 'Expiration.'),
(26819, 'Explain', 'a.', 'To flatten; to spread out; to unfold; to expand.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(26820, 'Explain', 'a.', 'To make plain, manifest, or intelligible; to clear of\n   obscurity; to expound; to unfold and illustrate the meaning of; as, to\n   explain a chapter of the Bible.'),
(26821, 'Explain', 'v. i.', 'To give an explanation.'),
(26822, 'Explat', 'v. t.', 'Alt. of Explate'),
(26823, 'Explate', 'v. t.', 'To explain; to unfold.'),
(26824, 'Explicit', 'a.', 'A word formerly used (as finis is now) at the conclusion\n   of a book to indicate the end.'),
(26825, 'Explicit', 'a.', 'Not implied merely, or conveyed by implication;\n   distinctly stated; plain in language; open to the understanding; clear;\n   not obscure or ambiguous; express; unequivocal; as, an explicit\n   declaration.'),
(26826, 'Explicit', 'a.', 'Having no disguised meaning or reservation; unreserved;\n   outspoken; -- applied to persons; as, he was earnest and explicit in\n   his statement.'),
(26827, 'Exploded', 'imp. & p. p.', 'of Explode'),
(26828, 'Explode', 'v. i.', 'To become suddenly expanded into a great volume of gas\n   or vapor; to burst violently into flame; as gunpowder explodes.'),
(26829, 'Explode', 'v. i.', 'To burst with force and a loud report; to detonate, as\n   a shell filled with powder or the like material, or as a boiler from\n   too great pressure of steam.'),
(26830, 'Explode', 'v. i.', 'To burst forth with sudden violence and noise; as, at\n   this, his wrath exploded.'),
(26831, 'Explode', 'v. t.', 'To drive from the stage by noisy expressions of\n   disapprobation; to hoot off; to drive away or reject noisily; as, to\n   explode a play.'),
(26832, 'Explode', 'v. t.', 'To bring into disrepute, and reject; to drive from\n   notice and acceptance; as, to explode a scheme, fashion, or doctrine.'),
(26833, 'Explode', 'v. t.', 'To cause to explode or burst noisily; to detonate; as,\n   to explode powder by touching it with fire.'),
(26834, 'Explode', 'v. t.', 'To drive out with violence and noise, as by powder.'),
(26835, 'Exploder', 'n.', 'One who or that which explodes.'),
(26836, 'Exploder', 'n.', 'One who rejects an opinion or scheme with open contempt.'),
(26837, 'Exploit', 'n.', 'A deed or act; especially, a heroic act; a deed of renown;\n   an adventurous or noble achievement; as, the exploits of Alexander the\n   Great.'),
(26838, 'Exploit', 'n.', 'Combat; war.'),
(26839, 'Exploit', 'n.', 'To utilize; to make available; to get the value or\n   usefulness out of; as, to exploit a mine or agricultural lands; to\n   exploit public opinion.'),
(26840, 'Exploit', 'n.', 'Hence: To draw an illegitimate profit from; to speculate\n   on; to put upon.'),
(26841, 'Explored', 'imp. & p. p.', 'of Explore'),
(26842, 'Explore', 'v. t.', 'To seek for or after; to strive to attain by search; to\n   look wisely and carefully for.'),
(26843, 'Explore', 'v. t.', 'To search through or into; to penetrate or range over\n   for discovery; to examine thoroughly; as, to explore new countries or\n   seas; to explore the depths of science.'),
(26844, 'Explorer', 'n.', 'One who explores; also, an apparatus with which one\n   explores, as a diving bell.'),
(26845, 'Eploring', 'a.', 'Employed in, or designed for, exploration.'),
(26846, 'Expolish', 'v. t.', 'To polish thoroughly.'),
(26847, 'Expone', 'v. t.', 'To expound; to explain; also, to expose; to imperil.'),
(26848, 'Exponent', 'n.', 'A number, letter, or any quantity written on the right\n   hand of and above another quantity, and denoting how many times the\n   latter is repeated as a factor to produce the power indicated'),
(26849, 'Exponent', 'n.', 'One who, or that which, stands as an index or\n   representative; as, the leader of a party is the exponent of its\n   principles.'),
(26850, 'Exported', 'imp. & p. p.', 'of Export'),
(26851, 'Export', 'v. t.', 'To carry away; to remove.'),
(26852, 'Export', 'v. t.', 'To carry or send abroad, or out of a country, especially\n   to foreign countries, as merchandise or commodities in the way of\n   commerce; -- the opposite of import; as, to export grain, cotton,\n   cattle, goods, etc.'),
(26853, 'Export', 'n.', 'The act of exporting; exportation; as, to prohibit the\n   export of wheat or tobacco.'),
(26854, 'Export', 'n.', 'That which is exported; a commodity conveyed from one\n   country or State to another in the way of traffic; -- used chiefly in\n   the plural, exports.'),
(26855, 'Exporter', 'n.', 'One who exports; the person who sends goods or\n   commodities to a foreign country, in the way of commerce; -- opposed to\n   importer.'),
(26856, 'Exposal', 'n.', 'Exposure.'),
(26857, 'Exposed', 'imp. & p. p.', 'of Expose'),
(26858, 'Exposing', 'p. pr. & vb. n.', 'of Expose'),
(26859, 'Expose', 'v. t.', 'To set forth; to set out to public view; to exhibit; to\n   show; to display; as, to expose goods for sale; to expose pictures to\n   public inspection.'),
(26860, 'Expose', 'v. t.', 'To lay bare; to lay open to attack, danger, or anything\n   objectionable; to render accessible to anything which may affect,\n   especially detrimentally; to make liable; as, to expose one\'s self to\n   the heat of the sun, or to cold, insult, danger, or ridicule; to expose\n   an army to destruction or defeat.'),
(26861, 'Expose', 'v. t.', 'To deprive of concealment; to discover; to lay open to\n   public inspection, or bring to public notice, as a thing that shuns\n   publicity, something criminal, shameful, or the like; as, to expose the\n   faults of a neighbor.'),
(26862, 'Expose', 'v. t.', 'To disclose the faults or reprehensible practices of; to\n   lay open to general condemnation or contempt by making public the\n   character or arts of; as, to expose a cheat, liar, or hypocrite.'),
(26863, 'Expose', 'v. t.', 'A formal recital or exposition of facts; exposure, or\n   revelation, of something which some one wished to keep concealed.'),
(26864, 'Exposer', 'n.', 'One who exposes or discloses.'),
(26865, 'Exposure', 'n.', 'The act of exposing or laying open, setting forth, laying\n   bare of protection, depriving of care or concealment, or setting out to\n   reprobation or contempt.'),
(26866, 'Exposure', 'n.', 'The state of being exposed or laid open or bare; openness\n   to danger; accessibility to anything that may affect, especially\n   detrimentally; as, exposure to observation, to cold, to inconvenience.'),
(26867, 'Exposure', 'n.', 'Position as to points of compass, or to influences of\n   climate, etc.'),
(26868, 'Exposure', 'n.', 'The exposing of a sensitized plate to the action of\n   light.'),
(26869, 'Expound', 'v. t.', 'To lay open; to expose to view; to examine.'),
(26870, 'Expound', 'v. t.', 'To lay open the meaning of; to explain; to clear of\n   obscurity; to interpret; as, to expound a text of Scripture, a law, a\n   word, a meaning, or a riddle.'),
(26871, 'Express', 'a.', 'Exactly representing; exact.'),
(26872, 'Express', 'a.', 'Directly and distinctly stated; declared in terms; not\n   implied or left to inference; made unambiguous by intention and care;\n   clear; not dubious; as, express consent; an express statement.'),
(26873, 'Express', 'a.', 'Intended for a particular purpose; relating to an express;\n   sent on a particular errand; dispatched with special speed; as, an\n   express messenger or train. Also used adverbially.'),
(26874, 'Express', 'n.', 'A clear image or representation; an expression; a plain\n   declaration.'),
(26875, 'Express', 'n.', 'A messenger sent on a special errand; a courier; hence, a\n   regular and fast conveyance; commonly, a company or system for the\n   prompt and safe transportation of merchandise or parcels; also, a\n   railway train for transporting passengers or goods with speed and\n   punctuality.'),
(26876, 'Express', 'n.', 'An express office.'),
(26877, 'Express', 'n.', 'That which is sent by an express messenger or message.'),
(26878, 'Express', 'a.', 'To press or squeeze out; as, to express the juice of\n   grapes, or of apples; hence, to extort; to elicit.'),
(26879, 'Express', 'a.', 'To make or offer a representation of; to show by a copy or\n   likeness; to represent; to resemble.'),
(26880, 'Express', 'a.', 'To give a true impression of; to represent and make known;\n   to manifest plainly; to show in general; to exhibit, as an opinion or\n   feeling, by a look, gesture, and esp. by language; to declare; to\n   utter; to tell.'),
(26881, 'Express', 'a.', 'To make known the opinions or feelings of; to declare what\n   is in the mind of; to show (one\'s self); to cause to appear; -- used\n   reflexively.'),
(26882, 'Express', 'a.', 'To denote; to designate.'),
(26883, 'Express', 'a.', 'To send by express messenger; to forward by special\n   opportunity, or through the medium of an express; as, to express a\n   package.'),
(26884, 'Expugn', 'v. t.', 'To take by assault; to storm; to overcome; to vanquish;\n   as, to expugn cities; to expugn a person by arguments.'),
(26885, 'Expugner', 'n.', 'One who expugns.'),
(26886, 'Expulse', 'v. t.', 'To drive out; to expel.'),
(26887, 'Expulser', 'n.', 'An expeller.'),
(26888, 'Expunged', 'imp. & p. p.', 'of Expunge'),
