(26961, 'Extra', 'n.', 'Something in addition to what is due, expected, or\n   customary; something in addition to the regular charge or compensation,\n   or for which an additional charge is made; as, at European hotels\n   lights are extras.'),
(26962, 'Extract', 'v. t.', 'To draw out or forth; to pull out; to remove forcibly\n   from a fixed position, as by traction or suction, etc.; as, to extract\n   a tooth from its socket, a stump from the earth, a splinter from the\n   finger.'),
