(27059, 'Fable', 'n.', 'The plot, story, or connected series of events, forming the\n   subject of an epic or dramatic poem.'),
(27060, 'Fable', 'n.', 'Any story told to excite wonder; common talk; the theme of\n   talk.'),
(27061, 'Fable', 'n.', 'Fiction; untruth; falsehood.'),
(27062, 'Fabled', 'imp. & p. p.', 'of Fable'),
(27063, 'Fabling', 'p. pr. & vb. n.', 'of Fable'),
