(27114, 'Facile', 'a.', 'Easily persuaded to good or bad; yielding; ductile to a\n   fault; pliant; flexible.'),
(27115, 'Facile', 'a.', 'Ready; quick; expert; as, he is facile in expedients; he\n   wields a facile pen.'),
(27116, 'Facility', 'n.', 'The quality of being easily performed; freedom from\n   difficulty; ease; as, the facility of an operation.'),
(27117, 'Facility', 'n.', 'Ease in performance; readiness proceeding from skill or\n   use; dexterity; as, practice gives a wonderful facility in executing\n   works of art.'),
(27118, 'Facility', 'n.', 'Easiness to be persuaded; readiness or compliance; --\n   usually in a bad sense; pliancy.'),
(27119, 'Facility', 'n.', 'Easiness of access; complaisance; affability.'),
(27120, 'Facility', 'n.', 'That which promotes the ease of any action or course of\n   conduct; advantage; aid; assistance; -- usually in the plural; as,\n   special facilities for study.'),
(27121, 'Facing', 'n.', 'A covering in front, for ornament or other purpose; an\n   exterior covering or sheathing; as, the facing of an earthen slope, sea\n   wall, etc. , to strengthen it or to protect or adorn the exposed\n   surface.'),
(27122, 'Facing', 'n.', 'A lining placed near the edge of a garment for ornament or\n   protection.'),
(27123, 'Facing', 'n.', 'The finishing of any face of a wall with material different\n   from that of which it is chiefly composed, or the coating or material\n   so used.'),
(27124, 'Facing', 'n.', 'A powdered substance, as charcoal, bituminous coal, ect.,\n   applied to the face of a mold, or mixed with the sand that forms it, to\n   give a fine smooth surface to the casting.'),
(27125, 'Facing', 'n.', 'The collar and cuffs of a military coat; -- commonly of a\n   color different from that of the coat.'),
(27126, 'Facing', 'n.', 'The movement of soldiers by turning on their heels to the\n   right, left, or about; -- chiefly in the pl.'),
(27127, 'Facingly', 'adv.', 'In a facing manner or position.'),
(27128, 'Facound', 'n.', 'Speech; eloquence.'),
(27129, 'Faction', 'n.', 'One of the divisions or parties of charioteers\n   (distinguished by their colors) in the games of the circus.'),
(27130, 'Faction', 'n.', 'A party, in political society, combined or acting in\n   union, in opposition to the government, or state; -- usually applied to\n   a minority, but it may be applied to a majority; a combination or\n   clique of partisans of any kind, acting for their own interests,\n   especially if greedy, clamorous, and reckless of the common good.'),
(27131, 'Faction', 'n.', 'Tumult; discord; dissension.'),
(27132, 'Factious', 'a.', 'Given to faction; addicted to form parties and raise\n   dissensions, in opposition to government or the common good; turbulent;\n   seditious; prone to clamor against public measures or men; -- said of\n   persons.'),
(27133, 'Factious', 'a.', 'Pertaining to faction; proceeding from faction;\n   indicating, or characterized by, faction; -- said of acts or\n   expressions; as, factious quarrels.'),
(27134, 'Factive', 'a.', 'Making; having power to make.'),
(27135, 'Facto', 'adv.', 'In fact; by the act or fact.'),
(27136, 'Factor', 'n.', 'One who transacts business for another; an agent; a\n   substitute; especially, a mercantile agent who buys and sells goods and\n   transacts business for others in commission; a commission merchant or\n   consignee. He may be a home factor or a foreign factor. He may buy and\n   sell in his own name, and he is intrusted with the possession and\n   control of the goods; and in these respects he differs from a broker.'),
(27137, 'Factor', 'n.', 'A steward or bailiff of an estate.'),
(27138, 'Factor', 'n.', 'One of the elements or quantities which, when multiplied\n   together, from a product.'),
(27139, 'Factor', 'n.', 'One of the elements, circumstances, or influences which\n   contribute to produce a result; a constituent.'),
(27140, 'Factored', 'imp. & p. p.', 'of Factor'),
(27141, 'Factor', 'v. t.', 'To resolve (a quantity) into its factors.'),
(27142, 'Factory', 'n.', 'A house or place where factors, or commercial agents,\n   reside, to transact business for their employers.'),
(27143, 'Factory', 'n.', 'The body of factors in any place; as, a chaplain to a\n   British factory.'),
(27144, 'Factory', 'n.', 'A building, or collection of buildings, appropriated to\n   the manufacture of goods; the place where workmen are employed in\n   fabricating goods, wares, or utensils; a manufactory; as, a cotton\n   factory.'),
(27145, 'Factotum', 'n.', 'A person employed to do all kinds of work or business.'),
(27146, 'Factual', 'a.', 'Relating to, or containing, facts.'),
(27147, 'Facta', 'pl. ', 'of Factum'),
(27148, 'Factum', 'n.', 'A man\'s own act and deed'),
(27149, 'Factum', 'n.', 'Anything stated and made certain.'),
(27150, 'Factum', 'n.', 'The due execution of a will, including everything necessary\n   to its validity.'),
(27151, 'Factum', 'n.', 'The product. See Facient, 2.'),
(27152, 'Facture', 'n.', 'The act or manner of making or doing anything; -- now used\n   of a literary, musical, or pictorial production.'),
(27153, 'Facture', 'n.', 'An invoice or bill of parcels.'),
(27154, 'Faculae', 'n. pl.', 'Groups of small shining spots on the surface of the\n   sun which are brighter than the other parts of the photosphere. They\n   are generally seen in the neighborhood of the dark spots, and are\n   supposed to be elevated portions of the photosphere.'),
(27155, 'Facular', 'a.', 'Of or pertaining to the faculae.'),
(27156, 'Faculty', 'n.', 'Ability to act or perform, whether inborn or cultivated;\n   capacity for any natural function; especially, an original mental power\n   or capacity for any of the well-known classes of mental activity;\n   psychical or soul capacity; capacity for any of the leading kinds of\n   soul activity, as knowledge, feeling, volition; intellectual endowment\n   or gift; power; as, faculties of the mind or the soul.'),
(27157, 'Faculty', 'n.', 'Special mental endowment; characteristic knack.'),
(27158, 'Faculty', 'n.', 'Power; prerogative or attribute of office.'),
(27159, 'Faculty', 'n.', 'Privilege or permission, granted by favor or indulgence,\n   to do a particular thing; authority; license; dispensation.'),
(27160, 'Faculty', 'n.', 'A body of a men to whom any specific right or privilege is\n   granted; formerly, the graduates in any of the four departments of a\n   university or college (Philosophy, Law, Medicine, or Theology), to whom\n   was granted the right of teaching (profitendi or docendi) in the\n   department in which they had studied; at present, the members of a\n   profession itself; as, the medical faculty; the legal faculty, ect.'),
(27161, 'Faculty', 'n.', 'The body of person to whom are intrusted the government\n   and instruction of a college or university, or of one of its\n   departments; the president, professors, and tutors in a college.'),
(27162, 'Facund', 'a.', 'Eloquent.'),
(27163, 'Faddle', 'v. i.', 'To trifle; to toy.'),
(27164, 'Faddle', 'v. t. ', 'To fondle; to dandle.'),
(27165, 'Faded', 'imp. & p. p.', 'of Fade'),
(27166, 'Fading', 'p. pr. & vb. n.', 'of Fade'),
(27167, 'Faded', 'a.', 'That has lost freshness, color, or brightness; grown dim.'),
(27168, 'Fadedly', 'adv.', 'In a faded manner.'),
(27169, 'Fadeless', 'a.', 'Not liable to fade; unfading.'),
(27170, 'Fader', 'n.', 'Father.'),
(27171, 'Fadge', 'a.', 'To fit; to suit; to agree.'),
(27172, 'Fadge', 'n.', 'A small flat loaf or thick cake; also, a fagot.'),
(27173, 'Fading', 'a.', 'Losing freshness, color, brightness, or vigor.'),
(27174, 'Fading', 'n.', 'Loss of color, freshness, or vigor.'),
(27175, 'Fading', 'n.', 'An Irish dance; also, the burden of a song.'),
(27176, 'Fadme', 'n.', 'A fathom.'),
(27177, 'Faecal', 'a.', 'See Fecal.'),
(27178, 'Faeces', 'n.pl.', 'Excrement; ordure; also, settlings; sediment after\n   infusion or distillation.'),
(27179, 'Faecula', 'n.', 'See Fecula.'),
(27180, 'Faery', 'n. & a.', 'Fairy.'),
(27181, 'Faffle', 'v. i.', 'To stammer.'),
(27182, 'Fagged', 'imp. & p. p.', 'of Fag'),
(27183, 'Fagging', 'p. pr. & vb. n.', 'of Fag'),
(27184, 'Fagend', 'n.', 'An end of poorer quality, or in a spoiled condition, as the\n   coarser end of a web of cloth, the untwisted end of a rope, ect.'),
(27185, 'Fagend', 'n.', 'The refuse or meaner part of anything.'),
(27186, 'Fagging', 'n.', 'Laborious drudgery; esp., the acting as a drudge for\n   another at an English school.'),
(27187, 'Fagot', 'n.', 'A bundle of sticks, twigs, or small branches of trees, used\n   for fuel, for raising batteries, filling ditches, or other purposes in\n   fortification; a fascine.'),
(27188, 'Fagot', 'n.', 'A bundle of pieces of wrought iron to be worked over into\n   bars or other shapes by rolling or hammering at a welding heat; a pile.'),
(27189, 'Fagot', 'n.', 'A bassoon. See Fagotto.'),
(27190, 'Fagot', 'n.', 'A person hired to take the place of another at the muster of\n   a company.'),
(27191, 'Fagot', 'n.', 'An old shriveled woman.'),
(27192, 'Fagoted', 'imp. & p. p.', 'of Fagot'),
(27193, 'Fagoting', 'p. pr. & vb. n.', 'of Fagot'),
(27194, 'Fagot', 'v. t.', 'To make a fagot of; to bind together in a fagot or\n   bundle; also, to collect promiscuously.'),
(27195, 'Fagotto', 'n.', 'The bassoon; -- so called from being divided into parts\n   for ease of carriage, making, as it were, a small fagot.'),
(27196, 'Faham', 'n.', 'The leaves of an orchid (Angraecum fragrans), of the islands\n   of Bourbon and Mauritius, used (in France) as a substitute for Chinese\n   tea.'),
(27197, 'Fahlband', 'n.', 'A stratum in crystalline rock, containing metallic\n   sulphides.'),
(27198, 'Fahlerz', 'n.', 'Alt. of Fahlband'),
(27199, 'Fahlband', 'n.', 'Same as Tetrahedrite.'),
(27200, 'Faience', 'n.', 'Glazed earthenware; esp., that which is decorated in\n   color.'),
(27201, 'Failed', 'imp. & p. p.', 'of Fail'),
(27202, 'Failing', 'p. pr. & vb. n.', 'of Fail'),
(27203, 'Failance', 'n.', 'Fault; failure; omission.'),
(27204, 'Failing', 'n.', 'A failing short; a becoming deficient; failure;\n   deficiency; imperfection; weakness; lapse; fault; infirmity; as, a\n   mental failing.'),
(27205, 'Failing', 'n.', 'The act of becoming insolvent of bankrupt.'),
(27206, 'Faille', 'n.', 'A soft silk, heavier than a foulard and not glossy.'),
(27207, 'Failure', 'n.', 'Cessation of supply, or total defect; a failing;\n   deficiency; as, failure of rain; failure of crops.'),
(27208, 'Failure', 'n.', 'Omission; nonperformance; as, the failure to keep a\n   promise.'),
(27209, 'Failure', 'n.', 'Want of success; the state of having failed.'),
(27210, 'Failure', 'n.', 'Decay, or defect from decay; deterioration; as, the\n   failure of memory or of sight.'),
(27211, 'Failure', 'n.', 'A becoming insolvent; bankruptcy; suspension of payment;\n   as, failure in business.'),
(27212, 'Failure', 'n.', 'A failing; a slight fault.'),
(27213, 'Faineant', 'a.', 'Doing nothing; shiftless.'),
(27214, 'Faineant', 'n.', 'A do-nothing; an idle fellow; a sluggard.'),
(27215, 'Faint', 'superl.', 'Lacking strength; weak; languid; inclined to swoon; as,\n   faint with fatigue, hunger, or thirst.'),
(27216, 'Faint', 'superl.', 'Wanting in courage, spirit, or energy; timorous;\n   cowardly; dejected; depressed; as, \"Faint heart ne\'er won fair lady.\"'),
(27217, 'Faint', 'superl.', 'Lacking distinctness; hardly perceptible; striking the\n   senses feebly; not bright, or loud, or sharp, or forcible; weak; as, a\n   faint color, or sound.'),
(27218, 'Faint', 'superl.', 'Performed, done, or acted, in a weak or feeble manner;\n   not exhibiting vigor, strength, or energy; slight; as, faint efforts;\n   faint resistance.'),
(27219, 'Faint', 'n.', 'The act of fainting, or the state of one who has fainted; a\n   swoon. [R.] See Fainting, n.'),
(27220, 'Fainted', 'imp. & p. p.', 'of Faint'),
(27221, 'Fainting', 'p. pr. & vb. n.', 'of Faint'),
(27222, 'Faint', 'v. i.', 'To become weak or wanting in vigor; to grow feeble; to\n   lose strength and color, and the control of the bodily or mental\n   functions; to swoon; -- sometimes with away. See Fainting, n.'),
(27223, 'Faint', 'n.', 'To sink into dejection; to lose courage or spirit; to become\n   depressed or despondent.'),
(27224, 'Faint', 'n.', 'To decay; to disappear; to vanish.'),
(27225, 'Faint', 'v. t.', 'To cause to faint or become dispirited; to depress; to\n   weaken.'),
(27226, 'Fainting', 'n.', 'Syncope, or loss of consciousness owing to a sudden\n   arrest of the blood supply to the brain, the face becoming pallid, the\n   respiration feeble, and the heat\'s beat weak.'),
(27227, 'Faintish', 'a.', 'Slightly faint; somewhat faint.'),
(27228, 'Faintly', 'adv.', 'In a faint, weak, or timidmanner.'),
(27229, 'Faints', 'n.pl.', 'The impure spirit which comes over first and last in the\n   distillation of whisky; -- the former being called the strong faints,\n   and the latter, which is much more abundant, the weak faints. This\n   crude spirit is much impregnated with fusel oil.'),
(27230, 'Fainty', 'a.', 'Feeble; languid.'),
(27231, 'Fairhood', 'n.', 'Fairness; beauty.'),
(27232, 'Fairily', 'adv.', 'In the manner of a fairy.'),
(27233, 'Fairing', 'n.', 'A present; originally, one given or purchased at a fair.'),
(27234, 'Fairish', 'a.', 'Tolerably fair.'),
(27235, 'Fairly', 'adv.', 'In a fair manner; clearly; openly; plainly; fully;\n   distinctly; frankly.'),
(27236, 'Fairly', 'adv.', 'Favorably; auspiciously; commodiously; as, a town fairly\n   situated for foreign traade.'),
(27237, 'Fairly', 'adv.', 'Honestly; properly.'),
(27238, 'Fairly', 'adv.', 'Softly; quietly; gently.'),
(27239, 'Fairness', 'n.', 'The state of being fair, or free form spots or stains, as\n   of the skin; honesty, as of dealing; candor, as of an argument, etc.'),
(27240, 'Fairway', 'n.', 'The navigable part of a river, bay, etc., through which\n   vessels enter or depart; the part of a harbor or channel ehich is kept\n   open and unobstructed for the passage of vessels.'),
(27241, 'Fairies', 'pl. ', 'of Fairy'),
(27242, 'Fairy', 'n.', 'Enchantment; illusion.'),
(27243, 'Fairy', 'n.', 'The country of the fays; land of illusions.'),
(27244, 'Fairy', 'n.', 'An imaginary supernatural being or spirit, supposed to\n   assume a human form (usually diminutive), either male or female, and to\n   meddle for good or evil in the affairs of mankind; a fay. See Elf, and\n   Demon.'),
(27245, 'Fairy', 'n.', 'An enchantress.'),
(27246, 'Fairy', 'a.', 'Of or pertaining to fairies.'),
(27247, 'Fairy', 'a.', 'Given by fairies; as, fairy money.'),
(27248, 'Faith', 'n.', 'Belief; the assent of the mind to the truth of what is\n   declared by another, resting solely and implicitly on his authority and\n   veracity; reliance on testimony.'),
(27249, 'Faith', 'n.', 'The assent of the mind to the statement or proposition of\n   another, on the ground of the manifest truth of what he utters; firm\n   and earnest belief, on probable evidence of any kind, especially in\n   regard to important moral truth.'),
(27250, 'Faith', 'n.', 'The belief in the historic truthfulness of the Scripture\n   narrative, and the supernatural origin of its teachings, sometimes\n   called historical and speculative faith.'),
(27251, 'Faith', 'n.', 'The belief in the facts and truth of the Scriptures, with a\n   practical love of them; especially, that confiding and affectionate\n   belief in the person and work of Christ, which affects the character\n   and life, and makes a man a true Christian, -- called a practical,\n   evangelical, or saving faith.'),
(27252, 'Faith', 'n.', 'That which is believed on any subject, whether in science,\n   politics, or religion; especially (Theol.), a system of religious\n   belief of any kind; as, the Jewish or Mohammedan faith; and especially,\n   the system of truth taught by Christ; as, the Christian faith; also,\n   the creed or belief of a Christian society or church.'),
(27253, 'Faith', 'n.', 'Fidelity to one\'s promises, or allegiance to duty, or to a\n   person honored and beloved; loyalty.'),
(27254, 'Faith', 'n.', 'Word or honor pledged; promise given; fidelity; as, he\n   violated his faith.'),
(27255, 'Faith', 'n.', 'Credibility or truth.'),
(27256, 'Faith', 'interj.', 'By my faith; in truth; verily.'),
(27257, 'Faithed', 'a.', 'Having faith or a faith; honest; sincere.'),
(27258, 'Faithful', 'a.', 'Full of faith, or having faith; disposed to believe,\n   especially in the declarations and promises of God.'),
(27259, 'Faithful', 'a.', 'Firm in adherence to promises, oaths, contracts,\n   treaties, or other engagements.'),
(27260, 'Faithful', 'a.', 'True and constant in affection or allegiance to a person\n   to whom one is bound by a vow, be ties of love, gratitude, or honor, as\n   to a husband, a prince, a friend; firm in the observance of duty;\n   loyal; of true fidelity; as, a faithful husband or servant.'),
(27261, 'Faithful', 'a.', 'Worthy of confidence and belief; conformable to truth ot\n   fact; exact; accurate; as, a faithful narrative or representation.'),
(27262, 'Faitour', 'n.', 'A doer or actor; particularly, an evil doer; a scoundrel.'),
(27263, 'Fakir', 'n.', 'An Oriental religious ascetic or begging monk.'),
(27264, 'Falanaka', 'n.', 'A viverrine mammal of Madagascar (Eupleres Goudotii),\n   allied to the civet; -- called also Falanouc.'),
(27265, 'Falcade', 'n.', 'The action of a horse, when he throws himself on his\n   haunches two or three times, bending himself, as it were, in very quick\n   curvets.'),
(27266, 'Falcate', 'a.', 'Alt. of Falcated'),
(27267, 'Falcated', 'a.', 'Hooked or bent like a sickle; as, a falcate leaf; a\n   falcate claw; -- said also of the moon, or a planet, when horned or\n   crescent-formed.'),
(27268, 'Falcer', 'n.', 'One of the mandibles of a spider.'),
(27269, 'Falchion', 'n.', 'A broad-bladed sword, slightly curved, shorter and\n   lighter than the ordinary sword; -- used in the Middle Ages.'),
(27270, 'Falchion', 'n.', 'A name given generally and poetically to a sword,\n   especially to the swords of Oriental and fabled warriors.'),
(27271, 'Falcon', 'n.', 'One of a family (Falconidae) of raptorial birds,\n   characterized by a short, hooked beak, strong claws, and powerful\n   flight.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(27272, 'Falcon', 'n.', 'Any species of the genus Falco, distinguished by having a\n   toothlike lobe on the upper mandible; especially, one of this genus\n   trained to the pursuit of other birds, or game.'),
(27273, 'Falcon', 'n.', 'An ancient form of cannon.'),
(27274, 'Falconer', 'n.', 'A person who breeds or trains hawks for taking birds or\n   game; one who follows the sport of fowling with hawks.'),
(27275, 'Falconet', 'n.', 'One of the smaller cannon used in the 15th century and\n   later.'),
(27276, 'Falconet', 'n.', 'One of several very small Asiatic falcons of the genus\n   Microhierax.'),
(27277, 'Falconet', 'n.', 'One of a group of Australian birds of the genus\n   Falcunculus, resembling shrikes and titmice.'),
(27278, 'Falconry', 'n.', 'The art of training falcons or hawks to pursue and attack\n   wild fowl or game.'),
(27279, 'Falconry', 'n.', 'The sport of taking wild fowl or game by means of falcons\n   or hawks.'),
(27280, 'Falcula', 'n.', 'A curved and sharp-pointed claw.'),
(27281, 'Faldage', 'n.', 'A privilege of setting up, and moving about, folds for\n   sheep, in any fields within manors, in order to manure them; -- often\n   reserved to himself by the lord of the manor.'),
(27282, 'Faldfee', 'n.', 'A fee or rent paid by a tenant for the privilege of\n   faldage on his own ground.'),
(27283, 'Falding', 'n.', 'A frieze or rough-napped cloth.'),
(27284, 'Fallen', 'p. p.', 'of Fall'),
(27285, 'Falling', 'p. pr. & vb. n.', 'of Fall'),
(27286, 'Fallacy', 'n.', 'Deceptive or false appearance; deceitfulness; that which\n   misleads the eye or the mind; deception.'),
(27287, 'Fallacy', 'n.', 'An argument, or apparent argument, which professes to be\n   decisive of the matter at issue, while in reality it is not; a sophism.'),
(27288, 'Fallals', 'n.pl.', 'Gay ornaments; frippery; gewgaws.'),
(27289, 'Fallax', 'n.', 'Cavillation; a caviling.'),
(27290, 'Fallen', 'a.', 'Dropped; prostrate; degraded; ruined; decreased; dead.'),
(27291, 'Fallency', 'n.', 'An exception.'),
(27292, 'Faller', 'n.', 'One who, or that which, falls.'),
(27293, 'Faller', 'n.', 'A part which acts by falling, as a stamp in a fulling mill,\n   or the device in a spinning machine to arrest motion when a thread\n   breaks.'),
(27294, 'Fallfish', 'n.', 'A fresh-water fish of the United States (Semotilus\n   bullaris); -- called also silver chub, and Shiner. The name is also\n   applied to other allied species.'),
(27295, 'Fallible', 'a.', 'Liable to fail, mistake, or err; liable to deceive or to\n   be deceived; as, all men are fallible; our opinions and hopes are\n   fallible.'),
(27296, 'Fallibly', 'adv.', 'In a fallible manner.'),
(27297, 'Falling', 'a. & n.', 'from Fall, v. i.'),
(27298, 'Fallow', 'a.', 'Pale red or pale yellow; as, a fallow deer or greyhound.'),
(27299, 'Fallow', 'n.', 'Left untilled or unsowed after plowing; uncultivated; as,\n   fallow ground.'),
(27300, 'Fallow', 'n.', 'Plowed land.'),
(27301, 'Fallow', 'n.', 'Land that has lain a year or more untilled or unseeded;\n   land plowed without being sowed for the season.'),
(27302, 'Fallow', 'n.', 'The plowing or tilling of land, without sowing it for a\n   season; as, summer fallow, properly conducted, has ever been found a\n   sure method of destroying weeds.'),
(27303, 'Fallowed', 'imp. & p. p.', 'of Fallow'),
(27304, 'Fallow', 'n.', 'To plow, harrow, and break up, as land, without seeding,\n   for the purpose of destroying weeds and insects, and rendering it\n   mellow; as, it is profitable to fallow cold, strong, clayey land.'),
(27305, 'Falsary', 'a.', 'A falsifier of evidence.'),
(27306, 'False', 'superl.', 'Uttering falsehood; unveracious; given to deceit;\n   dishnest; as, a false witness.'),
(27307, 'False', 'superl.', 'Not faithful or loyal, as to obligations, allegiance,\n   vows, etc.; untrue; treacherous; perfidious; as, a false friend, lover,\n   or subject; false to promises.'),
(27308, 'False', 'superl.', 'Not according with truth or reality; not true; fitted\n   or likely to deceive or disappoint; as, a false statement.'),
(27309, 'False', 'superl.', 'Not genuine or real; assumed or designed to deceive;\n   counterfeit; hypocritical; as, false tears; false modesty; false\n   colors; false jewelry.'),
(27310, 'False', 'superl.', 'Not well founded; not firm or trustworthy; erroneous;\n   as, a false claim; a false conclusion; a false construction in grammar.'),
(27311, 'False', 'superl.', 'Not essential or permanent, as parts of a structure\n   which are temporary or supplemental.'),
(27312, 'False', 'superl.', 'Not in tune.'),
(27313, 'False', 'adv.', 'Not truly; not honestly; falsely.'),
(27314, 'False', 'a.', 'To report falsely; to falsify.'),
(27315, 'False', 'a.', 'To betray; to falsify.'),
(27316, 'False', 'a.', 'To mislead by want of truth; to deceive.'),
(27317, 'False', 'a.', 'To feign; to pretend to make.'),
(27318, 'Falsely', 'adv.', 'In a false manner; erroneously; not truly; perfidiously\n   or treacherously.'),
(27319, 'Falser', 'n.', 'A deceiver.'),
(27320, 'Falsetto', 'n.', 'A false or artificial voice; that voice in a man which\n   lies above his natural voice; the male counter tenor or alto voice. See\n   Head voice, under Voice.'),
(27321, 'Falsify', 'a.', 'To make false; to represent falsely.'),
(27322, 'Falsify', 'a.', 'To counterfeit; to forge; as, to falsify coin.'),
(27323, 'Falsify', 'a.', 'To prove to be false, or untrustworthy; to confute; to\n   disprove; to nullify; to make to appear false.'),
(27324, 'Falsify', 'a.', 'To violate; to break by falsehood; as, to falsify one\'s\n   faith or word.'),
(27325, 'Falsify', 'a.', 'To baffle or escape; as, to falsify a blow.'),
(27326, 'Falsify', 'a.', 'To avoid or defeat; to prove false, as a judgment.'),
(27327, 'Falsify', 'a.', 'To show, in accounting, (an inem of charge inserted in an\n   account) to be wrong.'),
(27328, 'Falsify', 'a.', 'To make false by multilation or addition; to tamper with;\n   as, to falsify a record or document.'),
(27329, 'Falsify', 'v. i.', 'To tell lies; to violate the truth.'),
(27330, 'Falsism', 'n.', 'That which is evidently false; an assertion or statement\n   the falsity of which is plainly apparent; -- opposed to truism.'),
(27331, 'Falsity', 'a.', 'The quality of being false; coutrariety or want of\n   conformity to truth.'),
(27332, 'Falsity', 'a.', 'That which is false; falsehood; a lie; a false assertion.'),
(27333, 'Falter', 'v. t.', 'To thrash in the chaff; also, to cleanse or sift, as\n   barley.'),
(27334, 'Faltered', 'imp. & p. p.', 'of Falter'),
(27335, 'Falter', 'v. & n.', 'To hesitate; to speak brokenly or weakly; to stammer;\n   as, his tongue falters.'),
(27336, 'Falter', 'v. & n.', 'To tremble; to totter; to be unsteady.'),
(27337, 'Falter', 'v. & n.', 'To hesitate in purpose or action.'),
(27338, 'Falter', 'v. & n.', 'To fail in distinctness or regularity of exercise; --\n   said of the mind or of thought.'),
(27339, 'Falter', 'v. t.', 'To utter with hesitation, or in a broken, trembling, or\n   weak manner.'),
(27340, 'Falter', 'v. i.', 'Hesitation; trembling; feebleness; an uncertain or\n   broken sound; as, a slight falter in her voice.'),
(27341, 'Faluns', 'n.', 'A series of strata, of the Middle Tertiary period, of\n   France, abounding in shells, and used by Lyell as the type of his\n   Miocene subdivision.'),
(27342, 'Falwe', 'a. & n.', 'Fallow.'),
(27343, 'Famble', 'v. i.', 'To stammer.'),
(27344, 'Famble', 'v.', 'A hand.'),
(27345, 'Famed', 'imp. & p. p.', 'of Fame'),
(27346, 'Faming', 'p. pr. & vb. n.', 'of Fame'),
(27347, 'Fameless', 'a.', 'Without fame or renown.'),
(27348, 'Familiar', 'a.', 'Of or pertaining to a family; domestic.'),
(27349, 'Familiar', 'a.', 'Closely acquainted or intimate, as a friend or companion;\n   well versed in, as any subject of study; as, familiar with the\n   Scriptures.'),
(27350, 'Familiar', 'a.', 'Characterized by, or exhibiting, the manner of an\n   intimate friend; not formal; unconstrained; easy; accessible.'),
(27351, 'Familiar', 'a.', 'Well known; well understood; common; frequent; as, a\n   familiar illustration.'),
(27352, 'Familiar', 'a.', 'Improperly acquainted; wrongly intimate.'),
(27353, 'Familiar', 'n.', 'An intimate; a companion.'),
(27354, 'Familiar', 'n.', 'An attendant demon or evil spirit.'),
(27355, 'Familiar', 'n.', 'A confidential officer employed in the service of the\n   tribunal, especially in apprehending and imprisoning the accused.'),
(27356, 'Familism', 'n.', 'The tenets of the Familists.'),
(27357, 'Familist', 'n.', 'One of afanatical Antinomian sect originating in Holland,\n   and existing in England about 1580, called the Family of Love, who held\n   that religion consists wholly in love.'),
(27358, 'Families', 'pl. ', 'of Family'),
(27359, 'Family', 'v. t.', 'The collective body of persons who live in one house,\n   and under one head or manager; a household, including parents,\n   children, and servants, and, as the case may be, lodgers or boarders.'),
(27360, 'Family', 'v. t.', 'The group comprising a husband and wife and their\n   dependent children, constituting a fundamental unit in the organization\n   of society.'),
(27361, 'Family', 'v. t.', 'Those who descend from one common progenitor; a tribe,\n   clan, or race; kindred; house; as, the human family; the family of\n   Abraham; the father of a family.'),
(27362, 'Family', 'v. t.', 'Course of descent; genealogy; line of ancestors;\n   lineage.'),
(27363, 'Family', 'v. t.', 'Honorable descent; noble or respectable stock; as, a man\n   of family.'),
(27364, 'Family', 'v. t.', 'A group of kindred or closely related individuals; as, a\n   family of languages; a family of States; the chlorine family.'),
(27365, 'Family', 'v. t.', 'A group of organisms, either animal or vegetable,\n   related by certain points of resemblance in structure or development,\n   more comprehensive than a genus, because it is usually based on fewer\n   or less pronounced points of likeness. In zoology a family is less\n   comprehesive than an order; in botany it is often considered the same\n   thing as an order.'),
(27366, 'Famine', 'n.', 'General scarcity of food; dearth; a want of provisions;\n   destitution.'),
(27367, 'Famished', 'imp. & p. p.', 'of Famish'),
(27368, 'Famish', 'v. t.', 'To starve, kill, or destroy with hunger.'),
(27369, 'Famish', 'v. t.', 'To exhaust the strength or endurance of, by hunger; to\n   distress with hanger.'),
(27370, 'Famish', 'v. t.', 'To kill, or to cause to suffer extremity, by deprivation\n   or denial of anything necessary.'),
(27371, 'Famish', 'v. t.', 'To force or constrain by famine.'),
(27372, 'Famish', 'v. i.', 'To die of hunger; to starve.'),
(27373, 'Famish', 'v. i.', 'To suffer extreme hunger or thirst, so as to be\n   exhausted in strength, or to come near to perish.'),
(27374, 'Famish', 'v. i.', 'To suffer extremity from deprivation of anything\n   essential or necessary.'),
(27375, 'Famosity', 'n.', 'The state or quality of being famous.'),
(27376, 'Famous', 'a.', 'Celebrated in fame or public report; renowned; mach talked\n   of; distinguished in story; -- used in either a good or a bad sense,\n   chiefly the former; often followed by for; as, famous for erudition,\n   for eloquence, for military skill; a famous pirate.'),
(27377, 'Famoused', 'a.', 'Renowned.'),
(27378, 'Famously', 'adv.', 'In a famous manner; in a distinguished degree; greatly;\n   splendidly.'),
(27379, 'Famular', 'n.', 'Domestic; familiar.'),
(27380, 'Famulate', 'v. i.', 'To serve.'),
(27381, 'Famulist', 'n.', 'A collegian of inferior rank or position, corresponding\n   to the sizar at Cambridge.'),
(27382, 'Fanned', 'imp. & p. p.', 'of Fan'),
(27383, 'Fanning', 'p. pr. & vb. n.', 'of Fan'),
(27384, 'Fanal', 'n.', 'A lighthouse, or the apparatus placed in it for giving\n   light.'),
(27385, 'Fanatic', 'a.', 'Pertaining to, or indicating, fanaticism; extravagant in\n   opinions; ultra; unreasonable; excessively enthusiastic, especially on\n   religious subjects; as, fanatic zeal; fanatic notions.'),
(27386, 'Fanatic', 'n.', 'A person affected by excessive enthusiasm, particularly on\n   religious subjects; one who indulges wild and extravagant notions of\n   religion.'),
(27387, 'Fanatism', 'n.', 'Fanaticism.'),
(27388, 'Fancied', 'v. t.', 'Formed or conceived by the fancy; unreal; as, a fancied\n   wrong.'),
(27389, 'Fancier', 'n.', 'One who is governed by fancy.'),
(27390, 'Fancier', 'n.', 'One who fancies or has a special liking for, or interest\n   in, a particular object or class or objects; hence, one who breeds and\n   keeps for sale birds and animals; as, bird fancier, dog fancier, etc.'),
(27391, 'Fanciful', 'a.', 'Full of fancy; guided by fancy, rather than by reason and\n   experience; whimsical; as, a fanciful man forms visionary projects.'),
(27392, 'Fanciful', 'a.', 'Conceived in the fancy; not consistent with facts or\n   reason; abounding in ideal qualities or figures; as, a fanciful scheme;\n   a fanciful theory.'),
(27393, 'Fanciful', 'a.', 'Curiously shaped or constructed; as, she wore a fanciful\n   headdress.'),
(27394, 'Fancies', 'pl. ', 'of Fancy'),
(27395, 'Fancy', 'n.', 'The faculty by which the mind forms an image or a\n   representation of anything perceived before; the power of combining and\n   modifying such objects into new pictures or images; the power of\n   readily and happily creating and recalling such objects for the purpose\n   of amusement, wit, or embellishment; imagination.'),
(27396, 'Fancy', 'n.', 'An image or representation of anything formed in the mind;\n   conception; thought; idea; conceit.'),
(27397, 'Fancy', 'n.', 'An opinion or notion formed without much reflection;\n   caprice; whim; impression.'),
(27398, 'Fancy', 'n.', 'Inclination; liking, formed by caprice rather than reason;\n   as, to strike one\'s fancy; hence, the object of inclination or liking.'),
(27399, 'Fancy', 'n.', 'That which pleases or entertains the taste or caprice\n   without much use or value.'),
(27400, 'Fancy', 'n.', 'A sort of love song or light impromptu ballad.'),
(27401, 'Fancied', 'imp. & p. p.', 'of Fancy'),
(27402, 'Fancying', 'p. pr. & vb. n.', 'of Fancy'),
(27403, 'Fancy', 'v. i.', 'To figure to one\'s self; to believe or imagine something\n   without proof.'),
(27404, 'Fancy', 'v. i.', 'To love.'),
(27405, 'Fancy', 'v. t.', 'To form a conception of; to portray in the mind; to\n   imagine.'),
(27406, 'Fancy', 'v. t.', 'To have a fancy for; to like; to be pleased with,\n   particularly on account of external appearance or manners.'),
(27407, 'Fancy', 'v. t.', 'To believe without sufficient evidence; to imagine\n   (something which is unreal).'),
(27408, 'Fancy', 'a.', 'Adapted to please the fancy or taste; ornamental; as, fancy\n   goods.'),
(27409, 'Fancy', 'a.', 'Extravagant; above real value.'),
(27410, 'Fandango', 'n.', 'A lively dance, in 3-8 or 6-8 time, much practiced in\n   Spain and Spanish America. Also, the tune to which it is danced.'),
(27411, 'Fandango', 'n.', 'A ball or general dance, as in Mexico.'),
(27412, 'Fanega', 'n.', 'A dry measure in Spain and Spanish America, varying from 1/\n   to 2/ bushels; also, a measure of land.'),
(27413, 'Fanfare', 'n.', 'A flourish of trumpets, as in coming into the lists, etc.;\n   also, a short and lively air performed on hunting horns during the\n   chase.'),
(27414, 'Fanfaron', 'n.', 'A bully; a hector; a swaggerer; an empty boaster.'),
(27415, 'Fanfoot', 'n.', 'A species of gecko having the toes expanded into large\n   lobes for adhesion. The Egyptian fanfoot (Phyodactylus gecko) is\n   believed, by the natives, to have venomous toes.'),
(27416, 'Fanfoot', 'n.', 'Any moth of the genus Polypogon.'),
(27417, 'Fanged', 'a.', 'Having fangs or tusks; as, a fanged adder. Also used\n   figuratively.'),
(27418, 'Fangle', 'v. t.', 'Something new-fashioned; a foolish innovation; a gewgaw;\n   a trifling ornament.'),
(27419, 'Fangle', 'v. t.', 'To fashion.'),
(27420, 'Fangled', 'a.', 'New made; hence, gaudy; showy; vainly decorated. [Obs.,\n   except with the prefix new.] See Newfangled.'),
(27421, 'Fangless', 'a.', 'Destitute of fangs or tusks.'),
(27422, 'Fangot', 'n.', 'A quantity of wares, as raw silk, etc., from one hundred\n   weight.'),
(27423, 'Fanion', 'n.', 'A small flag sometimes carried at the head of the baggage\n   of a brigade.'),
(27424, 'Fanion', 'n.', 'A small flag for marking the stations in surveying.'),
(27425, 'Fanlike', 'a.', 'Resembling a fan;'),
(27426, 'Fanlike', 'a.', 'folded up like a fan, as certain leaves; plicate.'),
(27427, 'Fannel', 'n.', 'Same as Fanon.'),
(27428, 'Fanner', 'n.', 'One who fans.'),
(27429, 'Fanner', 'n.', 'A fan wheel; a fan blower. See under Fan.'),
(27430, 'Fanon', 'n.', 'A term applied to various articles, as: (a) A peculiar\n   striped scarf worn by the pope at mass, and by eastern bishops. (b) A\n   maniple.'),
(27431, 'Fan palm', '', 'Any palm tree having fan-shaped or radiate leaves; as the\n   Chamaerops humilis of Southern Europe; the species of Sabal and Thrinax\n   in the West Indies, Florida, etc.; and especially the great talipot\n   tree (Corypha umbraculifera) of Ceylon and Malaya. The leaves of the\n   latter are often eighteen feet long and fourteen wide, and are used for\n   umbrellas, tents, and roofs. When cut up, they are used for books and\n   manuscripts.'),
(27432, 'Fantail', 'n.', 'A variety of the domestic pigeon, so called from the shape\n   of the tail.'),
(27433, 'Fantail', 'n.', 'Any bird of the Australian genus Rhipidura, in which the\n   tail is spread in the form of a fan during flight. They belong to the\n   family of flycatchers.'),
(27434, 'Fantasia', 'n.', 'A continuous composition, not divided into what are\n   called movements, or governed by the ordinary rules of musical design,\n   but in which the author\'s fancy roves unrestricted by set form.'),
(27435, 'Fantasm', 'n.', 'Same as Phantasm.'),
(27436, 'Fantast', 'n.', 'One whose manners or ideas are fantastic.'),
(27437, 'Fantasy', 'n.', 'Fancy; imagination; especially, a whimsical or fanciful\n   conception; a vagary of the imagination; whim; caprice; humor.'),
(27438, 'Fantasy', 'n.', 'Fantastic designs.'),
(27439, 'Fantasy', 'v. t.', 'To have a fancy for; to be pleased with; to like; to\n   fancy.'),
(27440, 'Fantom', 'n.', 'See Phantom.'),
(27441, 'Faquir', 'n.', 'See Fakir.'),
(27442, 'Farabout', 'n.', 'A going out of the way; a digression.'),
(27443, 'Farad', 'n.', 'The standard unit of electrical capacity; the capacity of a\n   condenser whose charge, having an electro-motive force of one volt, is\n   equal to the amount of electricity which, with the same electromotive\n   force, passes through one ohm in one second; the capacity, which,\n   charged with one coulomb, gives an electro-motive force of one volt.'),
(27444, 'Faradic', 'a.', 'Of or pertaining to Michael Faraday, the distinguished\n   electrician; -- applied especially to induced currents of electricity,\n   as produced by certain forms of inductive apparatus, on account of\n   Faraday\'s investigations of their laws.'),
(27445, 'Faradism', 'n.', 'Alt. of Faradization'),
(27446, 'Farand', 'n.', 'See Farrand, n.'),
(27447, 'Farantly', 'a.', 'Orderly; comely; respectable.'),
(27448, 'Farced', 'imp. & p. p.', 'of Farce'),
(27449, 'Farcing', 'p. pr. & vb. n.', 'of Farce'),
(27450, 'Farce', 'v. t.', 'To stuff with forcemeat; hence, to fill with mingled\n   ingredients; to fill full; to stuff.'),
(27451, 'Farce', 'v. t.', 'To render fat.'),
(27452, 'Farce', 'v. t.', 'To swell out; to render pompous.'),
(27453, 'Farce', 'v. t.', 'Stuffing, or mixture of viands, like that used on\n   dressing a fowl; forcemeat.'),
(27454, 'Farce', 'v. t.', 'A low style of comedy; a dramatic composition marked by\n   low humor, generally written with little regard to regularity or\n   method, and abounding with ludicrous incidents and expressions.'),
(27455, 'Farce', 'v. t.', 'Ridiculous or empty show; as, a mere farce.'),
(27456, 'Farcical', 'a.', 'Pertaining to farce; appropriated to farce; ludicrous;\n   unnatural; unreal.'),
(27457, 'Farcical', 'a.', 'Of or pertaining to the disease called farcy. See Farcy,\n   n.'),
(27458, 'Farcimen', 'n.', 'Alt. of Farcin'),
(27459, 'Farcin', 'n.', 'Same as Farcy.'),
(27460, 'Farcing', 'n.', 'Stuffing; forcemeat.'),
(27461, 'Farctate', 'v. t.', 'Stuffed; filled solid; as, a farctate leaf, stem, or\n   pericarp; -- opposed to tubular or hollow.'),
(27462, 'Farcy', 'n.', 'A contagious disease of horses, associated with painful\n   ulcerating enlargements, esp. upon the head and limbs. It is of the\n   same nature as glanders, and is often fatal. Called also farcin, and\n   farcimen.'),
(27463, 'Fardage', 'n.', 'See Dunnage.'),
(27464, 'Fardel', 'n.', 'A bundle or little pack; hence, a burden.'),
(27465, 'Fardel', 'v. t.', 'To make up in fardels.'),
(27466, 'Fared', 'imp. & p. p.', 'of Fare'),
(27467, 'Faring', 'p. pr. & vb. n.', 'of Fare'),
(27468, 'Faren', '', 'p. p. of Fare, v. i.'),
(27469, 'Farewell', 'interj.', 'Go well; good-by; adieu; -- originally applied to a\n   person departing, but by custom now applied both to those who depart\n   and those who remain. It is often separated by the pronoun; as, fare\n   you well; and is sometimes used as an expression of separation only;\n   as, farewell the year; farewell, ye sweet groves; that is, I bid you\n   farewell.'),
(27470, 'Farewell', 'n.', 'A wish of happiness or welfare at parting; the parting\n   compliment; a good-by; adieu.'),
(27471, 'Farewell', 'n.', 'Act of departure; leave-taking; a last look at, or\n   reference to something.'),
(27472, 'Farewell', 'a.', 'Parting; valedictory; final; as, a farewell discourse;\n   his farewell bow.'),
(27473, 'Farfet', 'p. p.', 'Farfetched.'),
(27474, 'Farfetch', 'v. t.', 'To bring from far; to seek out studiously.'),
(27475, 'Farfetch', 'n.', 'Anything brought from far, or brought about with studious\n   care; a deep strategem.'),
(27476, 'Farina', 'n.', 'A fine flour or meal made from cereal grains or from the\n   starch or fecula of vegetables, extracted by various processes, and\n   used in cookery.'),
(27477, 'Farina', 'n.', 'Pollen.'),
(27478, 'Farinose', 'a.', 'Yielding farinaa; as, farinose substances.'),
(27479, 'Farinose', 'a.', 'Civered with a sort of white, mealy powder, as the leaves\n   of some poplars, and the body of certain insects; mealy.'),
(27480, 'Farlie', 'n.', 'An unusual or unexpected thing; a wonder. See Fearly.'),
(27481, 'Farmed', 'imp. & p. p.', 'of Farm'),
(27482, 'Farming', 'p. pr. & vb. n.', 'of Farm'),
(27483, 'Farmable', 'a.', 'Capable of being farmed.'),
(27484, 'Farmer', 'n.', 'One who farms'),
(27485, 'Farmer', 'n.', 'One who hires and cultivates a farm; a cultivator of leased\n   ground; a tenant.'),
(27486, 'Farmer', 'n.', 'One who is devoted to the tillage of the soil; one who\n   cultivates a farm; an agriculturist; a husbandman.'),
(27487, 'Farmer', 'n.', 'One who takes taxes, customs, excise, or other duties, to\n   collect, either paying a fixed annuual rent for the privilege; as, a\n   farmer of the revenues.'),
(27488, 'Farmer', 'n.', 'The lord of the field, or one who farms the lot and cope of\n   the crown.'),
(27489, 'Farmery', 'n.', 'The buildings and yards necessary for the business of a\n   farm; a homestead.'),
(27490, 'Farming', 'a.', 'Pertaining to agriculture; devoted to, adapted to, or\n   engaged in, farming; as, farming tools; farming land; a farming\n   community.'),
(27491, 'Farming', 'n.', 'The business of cultivating land.'),
(27492, 'Farmost', 'a.', 'Most distant; farthest.'),
(27493, 'Farmyard', 'n.', 'The yard or inclosure attached to a barn, or the space\n   inclosed by the farm buildings.'),
(27494, 'Farness', 'a.', 'The state of being far off; distance; remoteness.'),
(27495, 'Faroese', 'n. sing. & pl.', 'An inhabitant, or, collectively, inhabitants,\n   of the Faroe islands.'),
(27496, 'Far-off', 'a.', 'Remote; as, the far-off distance. Cf. Far-off, under Far,\n   adv.'),
(27497, 'Farrago', 'n.', 'A mass composed of various materials confusedly mixed; a\n   medley; a mixture.'),
(27498, 'Farrand', 'n.', 'Manner; custom; fashion; humor.'),
(27499, 'Farrier', 'n.', 'A shoer of horses; a veterinary surgeon.'),
(27500, 'Farrier', 'v. i.', 'To practice as a farrier; to carry on the trade of a\n   farrier.'),
(27501, 'Farriery', 'n.', 'The art of shoeing horses.'),
(27502, 'Farriery', 'n.', 'The art of preventing, curing, or mitigating diseases of\n   horses and cattle; the veterinary art.'),
(27503, 'Farriery', 'n.', 'The place where a smith shoes horses.'),
(27504, 'Farrow', 'n.', 'A little of pigs.'),
(27505, 'Farrowed', 'imp. & p. p.', 'of Farfow'),
(27506, 'Farfow', 'v. t. & i.', 'To bring forth (young); -- said only of swine.'),
(27507, 'Farrow', 'a.', 'Not producing young in a given season or year; -- said only\n   of cows.'),
(27508, 'Farry', 'n.', 'A farrow.'),
(27509, 'Farse', 'n.', 'An addition to, or a paraphrase of, some part of the Latin\n   service in the vernacular; -- common in English before the Reformation.'),
(27510, 'Farther', 'superl.', 'More remote; more distant than something else.'),
(27511, 'Farther', 'superl.', 'Tending to a greater distance; beyond a certain\n   point; additional; further.'),
(27512, 'Farther', 'adv.', 'At or to a greater distance; more remotely; beyond; as,\n   let us rest with what we have, without looking farther.'),
(27513, 'Farther', 'adv.', 'Moreover; by way of progress in treating a subject; as,\n   farther, let us consider the probable event.'),
(27514, 'Farther', 'v. t.', 'To help onward. [R.] See Further.'),
(27515, 'Farthest', 'Superl.', 'Most distant or remote; as, the farthest degree. See\n   Furthest.'),
(27516, 'Farthest', 'adv.', 'At or to the greatest distance. See Furthest.'),
(27517, 'Farthing', 'n.', 'The fourth of a penny; a small copper coin of Great\n   Britain, being a cent in United States currency.'),
(27518, 'Farthing', 'n.', 'A very small quantity or value.'),
(27519, 'Farthing', 'n.', 'A division of land.'),
(27520, 'Fasces', 'pl.', 'A bundle of rods, having among them an ax with the blade\n   projecting, borne before the Roman magistrates as a badge of their\n   authority.'),
(27521, 'Fascet', 'n.', 'A wire basket on the end of a rod to carry glass bottles,\n   etc., to the annealing furnace; also, an iron rod to be thrust into the\n   mouths of bottles, and used for the same purpose; -- called also pontee\n   and punty.'),
(27522, 'Fasciae', 'pl. ', 'of Fascia'),
(27523, 'Fascia', 'n.', 'A band, sash, or fillet; especially, in surgery, a bandage\n   or roller.'),
(27524, 'Fascia', 'n.', 'A flat member of an order or building, like a flat band or\n   broad fillet; especially, one of the three bands which make up the\n   architrave, in the Ionic order. See Illust. of Column.'),
(27525, 'Fascia', 'n.', 'The layer of loose tissue, often containing fat,\n   immediately beneath the skin; the stronger layer of connective tissue\n   covering and investing all muscles; an aponeurosis.'),
(27526, 'Fascia', 'n.', 'A broad well-defined band of color.'),
(27527, 'Fascial', 'a.', 'Pertaining to the fasces.'),
(27528, 'Fascial', 'a.', 'Relating to a fascia.'),
(27529, 'Fasciate', 'a.', 'Alt. of Fasciated'),
(27530, 'Fascicle', 'n.', 'A small bundle or collection; a compact cluster; as, a\n   fascicle of fibers; a fascicle of flowers or roots.'),
(27531, 'Fascine', 'n.', 'A cylindrical bundle of small sticks of wood, bound\n   together, used in raising batteries, filling ditches, strengthening\n   ramparts, and making parapets; also in revetments for river banks, and\n   in mats for dams, jetties, etc.'),
(27532, 'Fasciola', 'n.', 'A band of gray matter bordering the fimbria in the brain;\n   the dentate convolution.'),
(27533, 'Fasciole', 'n.', 'A band of minute tubercles, bearing modified spines, on\n   the shells of spatangoid sea urchins. See Spatangoidea.'),
(27534, 'Fashed', 'imp. & p. p.', 'of Fash'),
(27535, 'Fashing', 'p. pr. & vb. n.', 'of Fash'),
(27536, 'Fashion', 'n.', 'The make or form of anything; the style, shape,\n   appearance, or mode of structure; pattern, model; as, the fashion of\n   the ark, of a coat, of a house, of an altar, etc.; workmanship;\n   execution.'),
(27537, 'Fashion', 'n.', 'The prevailing mode or style, especially of dress; custom\n   or conventional usage in respect of dress, behavior, etiquette, etc.;\n   particularly, the mode or style usual among persons of good breeding;\n   as, to dress, dance, sing, ride, etc., in the fashion.'),
(27538, 'Fashion', 'n.', 'Polite, fashionable, or genteel life; social position;\n   good breeding; as, men of fashion.'),
(27539, 'Fashion', 'n.', 'Mode of action; method of conduct; manner; custom; sort;\n   way.'),
(27540, 'Fashion', 'v. t.', 'To form; to give shape or figure to; to mold.'),
(27541, 'Fashion', 'v. t.', 'To fit; to adapt; to accommodate; -- with to.'),
(27542, 'Fashion', 'v. t.', 'To make according to the rule prescribed by custom.'),
(27543, 'Fashion', 'v. t.', 'To forge or counterfeit.'),
(27544, 'Fassaite', 'n.', 'A variety of pyroxene, from the valley of Fassa, in the\n   Tyrol.'),
(27545, 'Fasted', 'imp. & p. p.', 'of Fast'),
(27546, 'Fasting', 'p. pr. & vb. n.', 'of Fast'),
(27547, 'Fastened', 'imp. & p. p.', 'of Fasten'),
(27548, 'Fasten', 'a.', 'To fix firmly; to make fast; to secure, as by a knot, lock,\n   bolt, etc.; as, to fasten a chain to the feet; to fasten a door or\n   window.'),
(27549, 'Fasten', 'a.', 'To cause to hold together or to something else; to attach\n   or unite firmly; to cause to cleave to something , or to cleave\n   together, by any means; as, to fasten boards together with nails or\n   cords; to fasten anything in our thoughts.'),
(27550, 'Fasten', 'a.', 'To cause to take close effect; to make to tell; to lay on;\n   as, to fasten a blow.'),
(27551, 'Fasten', 'v. i.', 'To fix one\'s self; to take firm hold; to clinch; to\n   cling.'),
(27552, 'Fastener', 'n.', 'One who, or that which, makes fast or firm.'),
(27553, 'Faster', 'n.', 'One who abstains from food.'),
(27554, 'Fasti', 'n.pl.', 'The Roman calendar, which gave the days for festivals,\n   courts, etc., corresponding to a modern almanac.'),
(27555, 'Fasti', 'n.pl.', 'Records or registers of important events.'),
(27556, 'Fastish', 'a.', 'Rather fast; also, somewhat dissipated.'),
(27557, 'Fastly', 'adv.', 'Firmly; surely.'),
(27558, 'Fastness', 'a.', 'The state of being fast and firm; firmness; fixedness;\n   security; faithfulness.'),
(27559, 'Fastness', 'a.', 'A fast place; a stronghold; a fortress or fort; a secure\n   retreat; a castle; as, the enemy retired to their fastnesses in the\n   mountains.'),
(27560, 'Fastness', 'a.', 'Conciseness of style.'),
(27561, 'Fastness', 'a.', 'The state of being fast or swift.'),
(27562, 'Fastuous', 'a.', 'Proud; haughty; disdainful.'),
(27563, 'Fatted', 'imp. & p. p.', 'of Fat'),
(27564, 'atting', 'p. pr. & vb. n.', 'of Fat'),
(27565, 'Fatal', 'a.', 'Proceeding from, or appointed by, fate or destiny;\n   necessary; inevitable.'),
(27566, 'Fatal', 'a.', 'Foreboding death or great disaster.'),
(27567, 'Fatal', 'a.', 'Causing death or destruction; deadly; mortal; destructive;\n   calamitous; as, a fatal wound; a fatal disease; a fatal day; a fatal\n   error.'),
(27568, 'Fatalism', 'n.', 'The doctrine that all things are subject to fate, or that\n   they take place by inevitable necessity.'),
(27569, 'Fatalist', 'n.', 'One who maintains that all things happen by inevitable\n   necessity.'),
(27570, 'Fatality', 'n.', 'The state of being fatal, or proceeding from destiny;\n   invincible necessity, superior to, and independent of, free and\n   rational control.'),
(27571, 'Fatality', 'n.', 'The state of being fatal; tendency to destruction or\n   danger, as if by decree of fate; mortaility.'),
(27572, 'Fatality', 'n.', 'That which is decreed by fate or which is fatal; a fatal\n   event.'),
(27573, 'Fatally', 'adv.', 'In a manner proceeding from, or determined by, fate.'),
(27574, 'Fatally', 'adv.', 'In a manner issuing in death or ruin; mortally;\n   destructively; as, fatally deceived or wounded.'),
(27575, 'Fatback', 'n.', 'The menhaden.'),
(27576, 'Fated', 'p. p. & a.', 'Decreed by fate; destined; doomed; as, he was fated\n   to rule a factious people.'),
(27577, 'Fated', 'p. p. & a.', 'Invested with the power of determining destiny.'),
(27578, 'Fated', 'p. p. & a.', 'Exempted by fate.'),
(27579, 'Fateful', 'a. .', 'Having the power of serving or accomplishing fate.'),
(27580, 'Fateful', 'a. .', 'Significant of fate; ominous.'),
(27581, 'Fathead', 'n.', 'A cyprinoid fish of the Mississippi valley (Pimephales\n   promelas); -- called also black-headed minnow.'),
(27582, 'Fathead', 'n.', 'A labroid food fish of California; the redfish.'),
(27583, 'Father', 'n.', 'One who has begotten a child, whether son or daughter; a\n   generator; a male parent.'),
(27584, 'Father', 'n.', 'A male ancestor more remote than a parent; a progenitor;\n   especially, a first ancestor; a founder of a race or family; -- in the\n   plural, fathers, ancestors.'),
(27585, 'Father', 'n.', 'One who performs the offices of a parent by maintenance,\n   affetionate care, counsel, or protection.'),
(27586, 'Father', 'n.', 'A respectful mode of address to an old man.'),
(27587, 'Father', 'n.', 'A senator of ancient Rome.'),
(27588, 'Father', 'n.', 'A dignitary of the church, a superior of a convent, a\n   confessor (called also father confessor), or a priest; also, the eldest\n   member of a profession, or of a legislative assembly, etc.'),
(27589, 'Father', 'n.', 'One of the chief esslesiastical authorities of the first\n   centuries after Christ; -- often spoken of collectively as the Fathers;\n   as, the Latin, Greek, or apostolic Fathers.'),
(27590, 'Father', 'n.', 'One who, or that which, gives origin; an originator; a\n   producer, author, or contriver; the first to practice any art,\n   profession, or occupation; a distinguished example or teacher.'),
(27591, 'Father', 'n.', 'The Supreme Being and Creator; God; in theology, the first\n   person in the Trinity.'),
(27592, 'Fathered', 'imp. & p. p.', 'of Father'),
(27593, 'Father', 'v. t.', 'To make one\'s self the father of; to beget.'),
(27594, 'Father', 'v. t.', 'To take as one\'s own child; to adopt; hence, to assume\n   as one\'s own work; to acknowledge one\'s self author of or responsible\n   for (a statement, policy, etc.).'),
(27595, 'Father', 'v. t.', 'To provide with a father.'),
(27596, 'Fatherly', 'a.', 'Like a father in affection and care; paternal; tender;\n   protecting; careful.'),
(27597, 'Fatherly', 'a.', 'Of or pertaining to a father.'),
(27598, 'Fathom', 'n.', 'A measure of length, containing six feet; the space to\n   which a man can extend his arms; -- used chiefly in measuring cables,\n   cordage, and the depth of navigable water by soundings.'),
(27599, 'Fathom', 'n.', 'The measure or extant of one\'s capacity; depth, as of\n   intellect; profundity; reach; penetration.'),
(27600, 'Fathomed', 'imp. & p. p.', 'of Fathom'),
(27601, 'Fathom', 'v. t.', 'To encompass with the arms extended or encircling; to\n   measure by throwing the arms about; to span.'),
(27602, 'Fathom', 'v. t.', 'The measure by a sounding line; especially, to sound the\n   depth of; to penetrate, measure, and comprehend; to get to the bottom\n   of.'),
(27603, 'Fathomer', 'n.', 'One who fathoms.'),
(27604, 'Fatigate', 'a.', 'Wearied; tired; fatigued.'),
(27605, 'Fatigate', 'v. t.', 'To weary; to tire; to fatigue.'),
(27606, 'Fatigue', 'n.', 'Weariness from bodily labor or mental exertion; lassitude\n   or exhaustion of strength.'),
(27607, 'Fatigue', 'n.', 'The cause of weariness; labor; toil; as, the fatigues of\n   war.'),
(27608, 'Fatigue', 'n.', 'The weakening of a metal when subjected to repeated\n   vibrations or strains.'),
(27609, 'Fatigued', 'imp. & p. p.', 'of Fatigue'),
(27610, 'Fatigue', 'n.', 'To weary with labor or any bodily or mental exertion; to\n   harass with toil; to exhaust the strength or endurance of; to tire.'),
(27611, 'Fatimite', 'a.', 'Alt. of Fatimide'),
(27612, 'Fatimide', 'a.', 'Descended from Fatima, the daughter and only child of\n   Mohammed.'),
(27613, 'Fatimide', 'n.', 'A descendant of Fatima.'),
(27614, 'Fatling', 'n.', 'A calf, lamb, kid, or other young animal fattened for\n   slaughter; a fat animal; -- said of such animals as are used for food.'),
(27615, 'Fatly', 'adv.', 'Grossly; greasily.'),
(27616, 'Fatner', 'n.', 'One who fattens. [R.] See Fattener.'),
(27617, 'Fatness', 'n.', 'The quality or state of being fat, plump, or full-fed;\n   corpulency; fullness of flesh.'),
(27618, 'Fatness', 'n.', 'Hence; Richness; fertility; fruitfulness.'),
(27619, 'Fatness', 'n.', 'That which makes fat or fertile.'),
(27620, 'Fattened', 'imp. & p. p.', 'of Fatten'),
(27621, 'Fatten', 'v. t.', 'To make fat; to feed for slaughter; to make fleshy or\n   plump with fat; to fill full; to fat.'),
(27622, 'Fatten', 'v. t.', 'To make fertile and fruitful; to enrich; as, to fatten\n   land; to fatten fields with blood.'),
(27623, 'Fatten', 'v. i.', 'To grow fat or corpulent; to grow plump, thick, or\n   fleshy; to be pampered.'),
(27624, 'Fattener', 'n.', 'One who, or that which, fattens; that which gives fatness\n   or fertility.'),
(27625, 'Fattish', 'a.', 'Somewhat fat; inclined to fatness.'),
(27626, 'Fatty', 'a.', 'Containing fat, or having the qualities of fat; greasy;\n   gross; as, a fatty substance.'),
(27627, 'Fatuity', 'n.', 'Weakness or imbecility of mind; stupidity.'),
(27628, 'Fatuous', 'a.', 'Feeble in mind; weak; silly; stupid; foolish; fatuitous.'),
(27629, 'Fatuous', 'a.', 'Without reality; illusory, like the ignis fatuus.'),
(27630, 'Faubourg', 'n.', 'A suburb of French city; also, a district now within a\n   city, but formerly without its walls.'),
(27631, 'Faucal', 'a.', 'Pertaining to the fauces, or opening of the throat;\n   faucial; esp., (Phon.) produced in the fauces, as certain deep guttural\n   sounds found in the Semitic and some other languages.'),
(27632, 'Fauces', 'n.pl.', 'The narrow passage from the mouth to the pharynx,\n   situated between the soft palate and the base of the tongue; -- called\n   also the isthmus of the fauces. On either side of the passage two\n   membranous folds, called the pillars of the fauces, inclose the\n   tonsils.'),
(27633, 'Fauces', 'n.pl.', 'The throat of a calyx, corolla, etc.'),
(27634, 'Fauces', 'n.pl.', 'That portion of the interior of a spiral shell which can\n   be seen by looking into the aperture.'),
(27635, 'Faucet', 'n.', 'A fixture for drawing a liquid, as water, molasses, oil,\n   etc., from a pipe, cask, or other vessel, in such quantities as may be\n   desired; -- called also tap, and cock. It consists of a tubular spout,\n   stopped with a movable plug, spigot, valve, or slide.'),
(27636, 'Faucet', 'n.', 'The enlarged end of a section of pipe which receives the\n   spigot end of the next section.'),
(27637, 'Fauchion', 'n.', 'See Falchion.'),
(27638, 'Faucial', 'a.', 'Pertaining to the fauces; pharyngeal.'),
(27639, 'Faugh', 'interj.', 'An exclamation of contempt, disgust, or abhorrence.'),
(27640, 'Faulcon', 'n.', 'See Falcon.'),
(27641, 'Fauld', 'n.', 'The arch over the dam of a blast furnace; the tymp arch.'),
(27642, 'Faule', 'n.', 'A fall or falling band.'),
(27643, 'Fault', 'n.', 'Defect; want; lack; default.'),
(27644, 'Fault', 'n.', 'Anything that fails, that is wanting, or that impairs\n   excellence; a failing; a defect; a blemish.'),
(27645, 'Fault', 'n.', 'A moral failing; a defect or dereliction from duty; a\n   deviation from propriety; an offense less serious than a crime.'),
(27646, 'Fault', 'n.', 'A dislocation of the strata of the vein.'),
(27647, 'Fault', 'n.', 'In coal seams, coal rendered worthless by impurities in the\n   seam; as, slate fault, dirt fault, etc.'),
(27648, 'Fault', 'n.', 'A lost scent; act of losing the scent.'),
(27649, 'Fault', 'n.', 'Failure to serve the ball into the proper court.'),
(27650, 'Faulted', 'imp. & p. p.', 'of Fault'),
(27651, 'Faulting', 'p. pr. & vb. n.', 'of Fault'),
(27652, 'Fault', 'v. t.', 'To charge with a fault; to accuse; to find fault with; to\n   blame.'),
(27653, 'Fault', 'v. t.', 'To interrupt the continuity of (rock strata) by\n   displacement along a plane of fracture; -- chiefly used in the p. p.;\n   as, the coal beds are badly faulted.'),
(27654, 'Fault', 'v. i.', 'To err; to blunder, to commit a fault; to do wrong.'),
(27655, 'Faulter', 'n.', 'One who commits a fault.'),
(27656, 'Faultful', 'a.', 'Full of faults or sins.'),
(27657, 'Faultily', 'adv.', 'In a faulty manner.'),
(27658, 'Faulting', 'n.', 'The state or condition of being faulted; the process by\n   which a fault is produced.'),
(27659, 'Faulty', 'a.', 'Containing faults, blemishes, or defects; imperfect; not\n   fit for the use intended.'),
(27660, 'Faulty', 'a.', 'Guilty of a fault, or of faults; hence, blamable; worthy of\n   censure.'),
(27661, 'Fauna', 'n.', 'The animals of any given area or epoch; as, the fauna of\n   America; fossil fauna; recent fauna.'),
(27662, 'Faunal', 'a.', 'Relating to fauna.'),
(27663, 'Faunist', 'n.', 'One who describes the fauna of country; a naturalist.'),
(27664, 'Fauni', 'pl. ', 'of Faunus'),
(27665, 'Faunus', 'n.', 'See Faun.'),
(27666, 'Fausen', 'n.', 'A young eel.'),
(27667, 'Fauteuil', 'n.', 'An armchair; hence (because the members sit in fauteuils\n   or armchairs), membership in the French Academy.'),
(27668, 'Fauteuil', 'n.', 'Chair of a presiding officer.'),
(27669, 'Fautor', 'n.', 'A favorer; a patron; one who gives countenance or support;\n   an abettor.'),
(27670, 'Fautress', 'n.', 'A patroness.'),
(27671, 'Fauvette', 'n.', 'A small singing bird, as the nightingale and warblers.'),
(27672, 'Fauces', 'pl. ', 'of Faux'),
(27673, 'faux pas', '', 'A false step; a mistake or wrong measure.'),
(27674, 'Favas', 'n.', 'See Favus, n., 2.'),
(27675, 'Favel', 'a.', 'Yellow; fal/ow; dun.'),
(27676, 'Favel', 'n.', 'A horse of a favel or dun color.'),
(27677, 'Favel', 'n.', 'Flattery; cajolery; deceit.'),
(27678, 'Favella', 'n.', 'A group of spores arranged without order and covered with\n   a thin gelatinous envelope, as in certain delicate red algae.'),
(27679, 'Favonian', 'a.', 'Pertaining to the west wind; soft; mild; gentle.'),
(27680, 'Favor', 'n.', 'Kind regard; propitious aspect; countenance; friendly\n   disposition; kindness; good will.'),
(27681, 'Favor', 'n.', 'The act of countenancing, or the condition of being\n   countenanced, or regarded propitiously; support; promotion;\n   befriending.'),
(27682, 'Favor', 'n.', 'A kind act or office; kindness done or granted; benevolence\n   shown by word or deed; an act of grace or good will, as distinct from\n   justice or remuneration.'),
(27683, 'Favor', 'n.', 'Mildness or mitigation of punishment; lenity.'),
(27684, 'Favor', 'n.', 'The object of regard; person or thing favored.'),
(27685, 'Favor', 'n.', 'A gift or represent; something bestowed as an evidence of\n   good will; a token of love; a knot of ribbons; something worn as a\n   token of affection; as, a marriage favor is a bunch or knot of white\n   ribbons or white flowers worn at a wedding.'),
(27686, 'Favor', 'n.', 'Appearance; look; countenance; face.'),
(27687, 'Favor', 'n.', 'Partiality; bias.'),
(27688, 'Favor', 'n.', 'A letter or epistle; -- so called in civility or compliment;\n   as, your favor of yesterday is received.'),
(27689, 'Favor', 'n.', 'Love locks.'),
(27690, 'Favored', 'imp. & p. p.', 'of Favor'),
(27691, 'Favoring', 'p. pr. & vb. n.', 'of Favor'),
(27692, 'Favor', 'n.', 'To regard with kindness; to support; to aid, or to have the\n   disposition to aid, or to wish success to; to be propitious to; to\n   countenance; to treat with consideration or tenderness; to show\n   partiality or unfair bias towards.'),
(27693, 'Favor', 'n.', 'To afford advantages for success to; to facilitate; as, a\n   weak place favored the entrance of the enemy.'),
(27694, 'Favor', 'n.', 'To resemble in features; to have the aspect or looks of; as,\n   the child favors his father.'),
(27695, 'Favored', 'a.', 'Countenanced; aided; regarded with kidness; as, a favored\n   friend.'),
(27696, 'Favored', 'a.', 'Having a certain favor or appearance; featured; as,\n   well-favored; hard-favored, etc.'),
(27697, 'Favorer', 'n.', 'One who favors; one who regards with kindness or\n   friendship; a well-wisher; one who assists or promotes success or\n   prosperity.'),
(27698, 'Favoress', 'n.', 'A woman who favors or gives countenance.'),
(27699, 'Favoring', 'a.', 'That favors.'),
(27700, 'Favorite', 'n.', 'A person or thing regarded with peculiar favor; one\n   treated with partiality; one preferred above others; especially, one\n   unduly loved, trusted, and enriched with favors by a person of high\n   rank or authority.'),
(27701, 'Favorite', 'n.', 'Short curls dangling over the temples; -- fashionable in\n   the reign of Charles II.'),
(27702, 'Favorite', 'n.', 'The competitor (as a horse in a race) that is judged most\n   likely to win; the competitor standing highest in the betting.'),
(27703, 'Favorite', 'a.', 'Regarded with particular affection, esteem, or\n   preference; as, a favorite walk; a favorite child.'),
(27704, 'Favose', 'a.', 'Honeycombed. See Faveolate.'),
(27705, 'Favose', 'a.', 'Of or pertaining to the disease called favus.'),
(27706, 'Favosite', 'a.', 'Like or pertaining to the genus Favosites.'),
(27707, 'Favus', 'n.', 'A disease of the scalp, produced by a vegetable parasite.'),
(27708, 'Favus', 'n.', 'A tile or flagstone cut into an hexagonal shape to produce a\n   honeycomb pattern, as in a pavement; -- called also favas and sectila.'),
(27709, 'Fawkner', 'n.', 'A falconer.'),
(27710, 'Fawned', 'imp. & p. p.', 'of Fawn'),
(27711, 'Fawning', 'p. pr. & vb. n.', 'of Fawn'),
(27712, 'Fawner', 'n.', 'One who fawns; a sycophant.'),
(27713, 'Faxed', 'a.', 'Hairy.'),
(27714, 'fayed', 'imp. & p. p.', 'of Fay'),
(27715, 'Faying', 'p. pr. & vb. n.', 'of Fay'),
(27716, 'Fayalite', 'n.', 'A black, greenish, or brownish mineral of the chrysolite\n   group. It is a silicate of iron.'),
(27717, 'Fayence', 'n.', 'See Fa/ence.'),
(27718, 'Faytour', 'n.', 'See Faitour.'),
(27719, 'Fazzolet', 'n.', 'A handkerchief.'),
(27720, 'Feaberry', 'n.', 'A gooseberry.'),
(27721, 'Feague', 'v. t.', 'To beat or whip; to drive.'),
(27722, 'Fealty', 'n.', 'Fidelity to one\'s lord; the feudal obligation by which the\n   tenant or vassal was bound to be faithful to his lord; the special oath\n   by which this obligation was assumed; fidelity to a superior power, or\n   to a government; loyality. It is no longer the practice to exact the\n   performance of fealty, as a feudal obligation.'),
(27723, 'Fealty', 'n.', 'Fidelity; constancy; faithfulness, as of a friend to a\n   friend, or of a wife to her husband.'),
(27724, 'Feared', 'imp. & p. p.', 'of Fear'),
(27725, 'Fearing', 'p. pr. & vb. n.', 'of Fear'),
(27726, 'Fearer', 'n.', 'One who fars.'),
(27727, 'Fearful', 'a.', 'Full of fear, apprehension, or alarm; afraid; frightened.'),
(27728, 'Fearful', 'a.', 'inclined to fear; easily frightened; without courage;\n   timid.'),
(27729, 'Fearful', 'a.', 'Indicating, or caused by, fear.'),
(27730, 'Fearful', 'a.', 'Inspiring fear or awe; exciting apprehension or terror;\n   terrible; frightful; dreadful.'),
(27731, 'Fearless', 'a.', 'Free from fear.'),
(27732, 'Fearsome', 'a.', 'Frightful; causing fear.'),
(27733, 'Fearsome', 'a.', 'Easily frightened; timid; timorous.'),
(27734, 'Feasible', 'a.', 'Capable of being done, executed, or effected;\n   practicable.'),
(27735, 'Feasible', 'a.', 'Fit to be used or tailed, as land.'),
(27736, 'Feast', 'n.', 'A festival; a holiday; a solemn, or more commonly, a joyous,\n   anniversary.'),
(27737, 'Feast', 'n.', 'A festive or joyous meal; a grand, ceremonious, or sumptuous\n   entertainment, of which many guests partake; a banquet characterized by\n   tempting variety and abundance of food.'),
(27738, 'Feast', 'n.', 'That which is partaken of, or shared in, with delight;\n   something highly agreeable; entertainment.'),
(27739, 'Feasted', 'imp. & p. p.', 'of Feast'),
(27740, 'Feasting', 'p. pr. & vb. n.', 'of Feast'),
(27741, 'Feast', 'n.', 'To eat sumptuously; to dine or sup on rich provisions,\n   particularly in large companies, and on public festivals.'),
(27742, 'Feast', 'n.', 'To be highly gratified or delighted.'),
(27743, 'Feast', 'v. t.', 'To entertain with sumptuous provisions; to treat at the\n   table bountifully; as, he was feasted by the king.'),
(27744, 'Feast', 'v. t.', 'To delight; to gratify; as, to feast the soul.'),
(27745, 'Feaster', 'n.', 'One who fares deliciously.'),
(27746, 'Feaster', 'n.', 'One who entertains magnificently.'),
(27747, 'Feastful', 'a.', 'Festive; festal; joyful; sumptuous; luxurious.'),
(27748, 'Feateous', 'a.', 'Dexterous; neat.'),
(27749, 'Feather', 'n.', 'One of the peculiar dermal appendages, of several kinds,\n   belonging to birds, as contour feathers, quills, and down.'),
(27750, 'Feather', 'n.', 'Kind; nature; species; -- from the proverbial phrase,\n   \"Birds of a feather,\" that is, of the same species.'),
(27751, 'Feather', 'n.', 'The fringe of long hair on the legs of the setter and some\n   other dogs.'),
(27752, 'Feather', 'n.', 'A tuft of peculiar, long, frizzly hair on a horse.'),
(27753, 'Feather', 'n.', 'One of the fins or wings on the shaft of an arrow.'),
(27754, 'Feather', 'n.', 'A longitudinal strip projecting as a fin from an object,\n   to strengthen it, or to enter a channel in another object and thereby\n   prevent displacement sidwise but permit motion lengthwise; a spline.'),
(27755, 'Feather', 'n.', 'A thin wedge driven between the two semicylindrical parts\n   of a divided plug in a hole bored in a stone, to rend the stone.'),
(27756, 'Feather', 'n.', 'The angular adjustment of an oar or paddle-wheel float,\n   with reference to a horizontal axis, as it leaves or enters the water.'),
(27757, 'Feather', 'v. t.', 'To furnish with a feather or feathers, as an arrow or a\n   cap.'),
(27758, 'Feather', 'v. t.', 'To adorn, as with feathers; to fringe.'),
(27759, 'Feather', 'v. t.', 'To render light as a feather; to give wings to.'),
(27760, 'Feather', 'v. t.', 'To enrich; to exalt; to benefit.'),
(27761, 'Feather', 'v. t.', 'To tread, as a cock.'),
(27762, 'Feather', 'v. i.', 'To grow or form feathers; to become feathered; -- often\n   with out; as, the birds are feathering out.'),
(27763, 'Feather', 'v. i.', 'To curdle when poured into another liquid, and float\n   about in little flakes or \"feathers;\" as, the cream feathers'),
(27764, 'Feather', 'v. i.', 'To turn to a horizontal plane; -- said of oars.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(27765, 'Feather', 'v. i.', 'To have the appearance of a feather or of feathers; to\n   be or to appear in feathery form.'),
(27766, 'Feathery', 'a.', 'Pertaining to, or resembling, feathers; covered with, or\n   as with, feathers; as, feathery spray or snow.'),
(27767, 'Featly', 'a.', 'Neatly; dexterously; nimbly.'),
(27768, 'Featness', 'n.', 'Skill; adroitness.'),
(27769, 'Feature', 'n.', 'The make, form, or outward appearance of a person; the\n   whole turn or style of the body; esp., good appearance.'),
(27770, 'Feature', 'n.', 'The make, cast, or appearance of the human face, and\n   especially of any single part of the face; a lineament. (pl.) The face,\n   the countenance.'),
(27771, 'Feature', 'n.', 'The cast or structure of anything, or of any part of a\n   thing, as of a landscape, a picture, a treaty, or an essay; any marked\n   peculiarity or characteristic; as, one of the features of the\n   landscape.'),
(27772, 'Feature', 'n.', 'A form; a shape.'),
(27773, 'Featured', 'a.', 'Shaped; fashioned.'),
(27774, 'Featured', 'a.', 'Having features; formed into features.'),
(27775, 'Feazed', 'imp. & p. p.', 'of Feaze'),
(27776, 'Feazing', 'p. pr. & vb. n.', 'of Feaze'),
(27777, 'Feaze', 'v. t.', 'To untwist; to unravel, as the end of a rope.'),
(27778, 'Feaze', 'v. t.', 'To beat; to chastise; also, to humble; to harass; to\n   worry.'),
(27779, 'Feaze', 'n.', 'A state of anxious or fretful excitement; worry; vexation.'),
(27780, 'Feazings', 'v. t.', 'The unlaid or ragged end of a rope.'),
(27781, 'Febrific', 'a.', 'Producing fever.'),
(27782, 'Febrile', 'a.', 'Pertaining to fever; indicating fever, or derived from it;\n   as, febrile symptoms; febrile action.'),
