(28257, 'Fidget', 'n.', 'A general nervous restlessness, manifested by incessant\n   changes of position; dysphoria.'),
(28258, 'Fidgety', 'a.', 'Restless; uneasy.'),
(28259, 'Fidia', 'n.', 'A genus of small beetles, of which one species (the\n   grapevine Fidia, F. longipes) is very injurious to vines in America.'),
(28260, 'Fiducial', 'a.', 'Having faith or trust; confident; undoubting; firm.'),
(28261, 'Fiducial', 'a.', 'Having the nature of a trust; fiduciary; as, fiducial\n   power.'),
(28262, 'Field', 'n.', 'Cleared land; land suitable for tillage or pasture;\n   cultivated ground; the open country.'),
(28263, 'Field', 'n.', 'A piece of land of considerable size; esp., a piece inclosed\n   for tillage or pasture.'),
(28264, 'Field', 'n.', 'A place where a battle is fought; also, the battle itself.'),
(28265, 'Field', 'n.', 'An open space; an extent; an expanse.'),
(28266, 'Field', 'n.', 'Any blank space or ground on which figures are drawn or\n   projected.'),
(28267, 'Field', 'n.', 'The space covered by an optical instrument at one view.'),
(28268, 'Field', 'n.', 'The whole surface of an escutcheon; also, so much of it is\n   shown unconcealed by the different bearings upon it. See Illust. of\n   Fess, where the field is represented as gules (red), while the fess is\n   argent (silver).'),
(28269, 'Field', 'n.', 'An unresticted or favorable opportunity for action,\n   operation, or achievement; province; room.'),
(28270, 'Field', 'n.', 'A collective term for all the competitors in any outdoor\n   contest or trial, or for all except the favorites in the betting.'),
(28271, 'Field', 'n.', 'That part of the grounds reserved for the players which is\n   outside of the diamond; -- called also outfield.'),
(28272, 'Fielded', 'imp. & p. p.', 'of Field'),
(28273, 'Fielding', 'p. pr. & vb. n.', 'of Field'),
(28274, 'Field', 'v. i.', 'To take the field.'),
(28275, 'Field', 'v. i.', 'To stand out in the field, ready to catch, stop, or throw\n   the ball.'),
(28276, 'Field', 'v. t.', 'To catch, stop, throw, etc. (the ball), as a fielder.'),
(28277, 'Fielded', 'a.', 'Engaged in the field; encamped.'),
(28278, 'Fielden', 'a.', 'Consisting of fields.'),
(28279, 'Fielder', 'n.', 'A ball payer who stands out in the field to catch or stop\n   balls.'),
(28280, 'Fielding', 'n.', 'The act of playing as a fielder.'),
(28281, 'Fieldy', 'a.', 'Open, like a field.'),
(28282, 'Fiend', 'n.', 'An implacable or malicious foe; one who is diabolically\n   wicked or cruel; an infernal being; -- applied specifically to the\n   devil or a demon.'),
(28283, 'Fiendful', 'a.', 'Full of fiendish spirit or arts.'),
(28284, 'Fiendish', 'a.', 'Like a fiend; diabolically wicked or cruel; infernal;\n   malignant; devilish; hellish.'),
(28285, 'Fiendly', 'a.', 'Fiendlike; monstrous; devilish.'),
(28286, 'Fierce', 'superl.', 'Furious; violent; unrestrained; impetuous; as, a\n   fierce wind.'),
(28287, 'Fierce', 'superl.', 'Vehement in anger or cruelty; ready or eager to kill\n   or injure; of a nature to inspire terror; ferocious.'),
(28288, 'Fierce', 'superl.', 'Excessively earnest, eager, or ardent.'),
(28289, 'Fiery', 'a.', 'Consisting of, containing, or resembling, fire; as, the\n   fiery gulf of Etna; a fiery appearance.'),
(28290, 'Fiery', 'a.', 'Vehement; ardent; very active; impetuous.'),
(28291, 'Fiery', 'a.', 'Passionate; easily provoked; irritable.'),
(28292, 'Fiery', 'a.', 'Unrestrained; fierce; mettlesome; spirited.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(28293, 'Fiery', 'a.', 'heated by fire, or as if by fire; burning hot; parched;\n   feverish.'),
(28294, 'Fifed', 'imp. & p. p.', 'of Fife'),
(28295, 'fifing', 'p. pr. & vb. n.', 'of Fife'),
(28296, 'Fifer', 'n.', 'One who plays on a fife.'),
(28297, 'Fifteen', 'a.', 'Five and ten; one more than fourteen.'),
(28298, 'Fifteen', 'n.', 'The sum of five and ten; fifteen units or objects.'),
(28299, 'Fifteen', 'n.', 'A symbol representing fifteen units, as 15, or xv.'),
(28300, 'Fifth', 'a.', 'Next in order after the fourth; -- the ordinal of five.'),
(28301, 'Fifth', 'a.', 'Consisting of one of five equal divisions of a thing.'),
(28302, 'Fifth', 'n.', 'The quotient of a unit divided by five; one of five equal\n   parts; a fifth part.'),
(28303, 'Fifth', 'n.', 'The interval of three tones and a semitone, embracing five\n   diatonic degrees of the scale; the dominant of any key.'),
(28304, 'Fifthly', 'adv.', 'In the fifth place; as the fifth in order.'),
(28305, 'Fiftieth', 'a.', 'Next in order after the forty-ninth; -- the ordinal of\n   fifty.'),
(28306, 'Fiftieth', 'a.', 'Consisting of one of fifty equal parts or divisions.'),
(28307, 'Fiftieth', 'n.', 'One of fifty equal parts; the quotient of a unit divided\n   by fifty.'),
(28308, 'Fifty', 'a.', 'Five times ten; as, fifty men.'),
(28309, 'Fifties', 'pl. ', 'of Fifty'),
(28310, 'Fifty', 'n.', 'The sum of five tens; fifty units or objects.'),
(28311, 'Fifty', 'n.', 'A symbol representing fifty units, as 50, or l.'),
(28312, 'Figaro', 'n.', 'An adroit and unscrupulous intriguer.'),
(28313, 'Figary', 'n.', 'A frolic; a vagary; a whim.'),
(28314, 'Figeater', 'n.', 'A large beetle (Allorhina nitida) which in the Southern\n   United States destroys figs. The elytra are velvety green with pale\n   borders.'),
(28315, 'Figeater', 'n.', 'A bird. See Figpecker.'),
(28316, 'Figent', 'a.', 'Fidgety; restless.'),
(28317, 'Figgum', 'n.', 'A juggler\'s trick; conjuring.'),
(28318, 'Fought', 'imp. & p. p.', 'of Fight'),
(28319, 'Fighting', 'p. pr. & vb. n.', 'of Fight'),
(28320, 'Fight', 'v. i.', 'To strive or contend for victory, with armies or in\n   single combat; to attempt to defeat, subdue, or destroy an enemy,\n   either by blows or weapons; to contend in arms; -- followed by with or\n   against.'),
(28321, 'Fight', 'v. i.', 'To act in opposition to anything; to struggle against; to\n   contend; to strive; to make resistance.'),
(28322, 'Fight', 'v. t.', 'To carry on, or wage, as a conflict, or battle; to win or\n   gain by struggle, as one\'s way; to sustain by fighting, as a cause.'),
(28323, 'Fight', 'v. t.', 'To contend with in battle; to war against; as, they\n   fought the enemy in two pitched battles; the sloop fought the frigate\n   for three hours.'),
(28324, 'Fight', 'v. t.', 'To cause to fight; to manage or maneuver in a fight; as,\n   to fight cocks; to fight one\'s ship.'),
(28325, 'Fight', 'v. i.', 'A battle; an engagement; a contest in arms; a combat; a\n   violent conflict or struggle for victory, between individuals or\n   between armies, ships, or navies, etc.'),
(28326, 'Fight', 'v. i.', 'A struggle or contest of any kind.'),
(28327, 'Fight', 'v. i.', 'Strength or disposition for fighting; pugnacity; as, he\n   has a great deal of fight in him.'),
(28328, 'Fight', 'v. i.', 'A screen for the combatants in ships.'),
(28329, 'Fighter', 'n.', 'One who fights; a combatant; a warrior.'),
(28330, 'Fighting', 'a.', 'Qualified for war; fit for battle.'),
(28331, 'Fighting', 'a.', 'Occupied in war; being the scene of a battle; as, a\n   fighting field.'),
(28332, 'Figment', 'n.', 'An invention; a fiction; something feigned or imagined.'),
(28333, 'Figulate', 'a.', 'Alt. of Figulated'),
(28334, 'Figuline', 'n.', 'A piece of pottery ornamented with representations of\n   natural objects.'),
(28335, 'Figural', 'a.', 'Represented by figure or delineation; consisting of\n   figures; as, figural ornaments.'),
(28336, 'Figural', 'a.', 'Figurate. See Figurate.'),
(28337, 'Figurant', 'n. masc.', 'One who dances at the opera, not singly, but in\n   groups or figures; an accessory character on the stage, who figures in\n   its scenes, but has nothing to say; hence, one who figures in any\n   scene, without taking a prominent part.'),
(28338, 'Figurate', 'a.', 'Of a definite form or figure.'),
(28339, 'Figurate', 'a.', 'Figurative; metaphorical.'),
(28340, 'Figurate', 'a.', 'Florid; figurative; involving passing discords by the\n   freer melodic movement of one or more parts or voices in the harmony;\n   as, figurate counterpoint or descant.'),
(28341, 'Figure', 'n.', 'The form of anything; shape; outline; appearance.'),
(28342, 'Figure', 'n.', 'The representation of any form, as by drawing, painting,\n   modeling, carving, embroidering, etc.; especially, a representation of\n   the human body; as, a figure in bronze; a figure cut in marble.'),
(28343, 'Figure', 'n.', 'A pattern in cloth, paper, or other manufactured article; a\n   design wrought out in a fabric; as, the muslin was of a pretty figure.'),
(28344, 'Figure', 'n.', 'A diagram or drawing; made to represent a magnitude or the\n   relation of two or more magnitudes; a surface or space inclosed on all\n   sides; -- called superficial when inclosed by lines, and solid when\n   inclosed by surface; any arrangement made up of points, lines, angles,\n   surfaces, etc.'),
(28345, 'Figure', 'n.', 'The appearance or impression made by the conduct or carrer\n   of a person; as, a sorry figure.'),
(28346, 'Figure', 'n.', 'Distinguished appearance; magnificence; conspicuous\n   representation; splendor; show.'),
(28347, 'Figure', 'n.', 'A character or symbol representing a number; a numeral; a\n   digit; as, 1, 2,3, etc.'),
(28348, 'Figure', 'n.', 'Value, as expressed in numbers; price; as, the goods are\n   estimated or sold at a low figure.'),
(28349, 'Figure', 'n.', 'A person, thing, or action, conceived of as analogous to\n   another person, thing, or action, of which it thus becomes a type or\n   representative.'),
(28350, 'Figure', 'n.', 'A mode of expressing abstract or immaterial ideas by words\n   which suggest pictures or images from the physical world; pictorial\n   language; a trope; hence, any deviation from the plainest form of\n   statement.'),
(28351, 'Figure', 'n.', 'The form of a syllogism with respect to the relative\n   position of the middle term.'),
(28352, 'Figure', 'n.', 'Any one of the several regular steps or movements made by a\n   dancer.'),
(28353, 'Figure', 'n.', 'A horoscope; the diagram of the aspects of the astrological\n   houses.'),
(28354, 'Figure', 'n.', 'Any short succession of notes, either as melody or as a\n   group of chords, which produce a single complete and distinct\n   impression.'),
(28355, 'Figure', 'n.', 'A form of melody or accompaniment kept up through a strain\n   or passage; a musical or motive; a florid embellishment.'),
(28356, 'Figured', 'imp. & p. p.', 'of Figure'),
(28357, 'Figuring', 'p. pr. & vb. n.', 'of Figure'),
(28358, 'Figure', 'n.', 'To represent by a figure, as to form or mold; to make an\n   image of, either palpable or ideal; also, to fashion into a determinate\n   form; to shape.'),
(28359, 'Figure', 'n.', 'To embellish with design; to adorn with figures.'),
(28360, 'Figure', 'n.', 'To indicate by numerals; also, to compute.'),
(28361, 'Figure', 'n.', 'To represent by a metaphor; to signify or symbolize.'),
(28362, 'Figure', 'n.', 'To prefigure; to foreshow.'),
(28363, 'Figure', 'n.', 'To write over or under the bass, as figures or other\n   characters, in order to indicate the accompanying chords.'),
(28364, 'Figure', 'n.', 'To embellish.'),
(28365, 'Figure', 'v. t.', 'To make a figure; to be distinguished or conspicious;\n   as, the envoy figured at court.'),
(28366, 'Figure', 'v. t.', 'To calculate; to contrive; to scheme; as, he is figuring\n   to secure the nomination.'),
(28367, 'Figured', 'a.', 'Adorned with figures; marked with figures; as, figured\n   muslin.'),
(28368, 'Figured', 'a.', 'Not literal; figurative.'),
(28369, 'Figured', 'a.', 'Free and florid; as, a figured descant. See Figurate, 3.'),
(28370, 'Figured', 'a.', 'Indicated or noted by figures.'),
(28371, 'Figurial', 'a.', 'Represented by figure or delineation.'),
(28372, 'Figurine', 'n.', 'A very small figure, whether human or of an animal;\n   especially, one in terra cotta or the like; -- distinguished from\n   statuette, which is applied to small figures in bronze, marble, etc.'),
(28373, 'Figurist', 'n.', 'One who uses or interprets figurative expressions.'),
(28374, 'Figwort', 'n.', 'A genus of herbaceous plants (Scrophularia), mostly found\n   in the north temperate zones. See Brownwort.'),
(28375, 'Fijian', 'a.', 'Of or pertaining to the Fiji islands or their inhabitants.'),
(28376, 'Fijian', 'n.', 'A native of the Fiji islands.'),
(28377, 'Filacer', 'n.', 'A former officer in the English Court of Common Pleas; --\n   so called because he filed the writs on which he made out process.'),
(28378, 'Filament', 'n.', 'A thread or threadlike object or appendage; a fiber; esp.\n   (Bot.), the threadlike part of the stamen supporting the anther.'),
(28379, 'Filander', 'n.', 'A species of kangaroo (Macropus Brunii), inhabiting New\n   Guinea.'),
(28380, 'Filar', 'a.', 'Of or pertaining to a thread or line; characterized by\n   threads stretched across the field of view; as, a filar microscope; a\n   filar micrometer.'),
(28381, 'Filaria', 'n.', 'A genus of slender, nematode worms of many species,\n   parasitic in various animals. See Guinea worm.'),
(28382, 'Filatory', 'n.', 'A machine for forming threads.'),
(28383, 'Filature', 'n.', 'A drawing out into threads; hence, the reeling of silk\n   from cocoons.'),
(28384, 'Filature', 'n.', 'A reel for drawing off silk from cocoons; also, an\n   establishment for reeling silk.'),
(28385, 'Filbert', 'n.', 'The fruit of the Corylus Avellana or hazel. It is an oval\n   nut, containing a kernel that has a mild, farinaceous, oily taste,\n   agreeable to the palate.'),
(28386, 'Filched', 'imp. & p. p.', 'of Filch'),
(28387, 'Filching', 'p. pr. & vb. n.', 'of Filch'),
(28388, 'Filch', 'v. t.', 'To steal or take privily (commonly, that which is of\n   little value); to pilfer.'),
(28389, 'Filcher', 'n.', 'One who filches; a thief.'),
(28390, 'Filed', 'imp. & p. p.', 'of File'),
(28391, 'Filing', 'p. pr. & vb. n.', 'of File'),
(28392, 'Filefish', 'n.', 'Any plectognath fish of the genera Monacanthus, Alutera,\n   balistes, and allied genera; -- so called on account of the roughly\n   granulated skin, which is sometimes used in place of sandpaper.'),
(28393, 'Filemot', 'n.', 'See Feullemort.'),
(28394, 'Filer', 'n.', 'One who works with a file.'),
(28395, 'Filial', 'a.', 'Of or pertaining to a son or daughter; becoming to a child\n   in relation to his parents; as, filial obedience.'),
(28396, 'Filial', 'a.', 'Bearing the relation of a child.'),
(28397, 'Filially', 'adv.', 'In a filial manner.'),
(28398, 'Filiate', 'v. t.', 'To adopt as son or daughter; to establish filiation\n   between.'),
(28399, 'Filibeg', 'n.', 'Same as Kilt.'),
(28400, 'Filical', 'a.', 'Belonging to the Filices, r ferns.'),
(28401, 'Filicic', 'a.', 'Pertaining to, or derived from, ferns; as, filicic acid.'),
(28402, 'Filicide', 'n.', 'The act of murdering a son or a daughter; also, parent\n   who commits such a murder.'),
(28403, 'Filicoid', 'a.', 'Fernlike, either in form or in the nature of the method\n   of reproduction.'),
(28404, 'Filicoid', 'n.', 'A fernlike plant.'),
(28405, 'Filiety', 'n.', 'The relation of a son to a father; sonship; -- the\n   correlative of paternity.'),
(28406, 'Filiform', 'a.', 'Having the shape of a thread or filament; as, the\n   filiform papillae of the tongue; a filiform style or peduncle. See\n   Illust. of AntennAe.'),
(28407, 'Filigree', 'n.', 'Ornamental work, formerly with grains or breads, but now\n   composed of fine wire and used chiefly in decorating gold and silver to\n   which the wire is soldered, being arranged in designs frequently of a\n   delicate and intricate arabesque pattern.'),
(28408, 'Filigree', 'a.', 'Relating to, composed of, or resembling, work in\n   filigree; as, a filigree basket. Hence: Fanciful; unsubstantial; merely\n   decorative.'),
(28409, 'Filing', 'n.', 'A fragment or particle rubbed off by the act of filing; as,\n   iron filings.'),
(28410, 'Filled', 'imp. & p. p.', 'of Fill'),
(28411, 'Filling', 'p. pr. & vb. n.', 'of Fill'),
(28412, 'Filler', 'n.', 'One who, or that which, fills; something used for filling.'),
(28413, 'Filler', 'n.', 'A thill horse.'),
(28414, 'Fillet', 'n.', 'A little band, especially one intended to encircle the hair\n   of the head.'),
(28415, 'Fillet', 'n.', 'A piece of lean meat without bone; sometimes, a long strip\n   rolled together and tied.'),
(28416, 'Fillet', 'n.', 'A thin strip or ribbon; esp.: (a) A strip of metal from\n   which coins are punched. (b) A strip of card clothing. (c) A thin\n   projecting band or strip.'),
(28417, 'Fillet', 'n.', 'A concave filling in of a reentrant angle where two\n   surfaces meet, forming a rounded corner.'),
(28418, 'Fillet', 'n.', 'A narrow flat member; especially, a flat molding separating\n   other moldings; a reglet; also, the space between two flutings in a\n   shaft. See Illust. of Base, and Column.'),
(28419, 'Fillet', 'n.', 'An ordinary equaling in breadth one fourth of the chief, to\n   the lowest portion of which it corresponds in position.'),
(28420, 'Fillet', 'n.', 'The thread of a screw.'),
(28421, 'Fillet', 'n.', 'A border of broad or narrow lines of color or gilt.'),
(28422, 'Fillet', 'n.', 'The raised molding about the muzzle of a gun.'),
(28423, 'Fillet', 'n.', 'Any scantling smaller than a batten.'),
(28424, 'Fillet', 'n.', 'A fascia; a band of fibers; applied esp. to certain bands\n   of white matter in the brain.'),
(28425, 'Fillet', 'n.', 'The loins of a horse, beginning at the place where the\n   hinder part of the saddle rests.'),
(28426, 'Filleted', 'imp. & p. p.', 'of Fillet'),
(28427, 'Fillet', 'v. t.', 'To bind, furnish, or adorn with a fillet.'),
(28428, 'Fillibeg', 'n.', 'A kilt. See Filibeg.'),
(28429, 'Filling', 'n.', 'That which is used to fill a cavity or any empty space, or\n   to supply a deficiency; as, filling for a cavity in a tooth, a\n   depression in a roadbed, the space between exterior and interior walls\n   of masonry, the pores of open-grained wood, the space between the outer\n   and inner planks of a vessel, etc.'),
(28430, 'Filling', 'n.', 'The woof in woven fabrics.'),
(28431, 'Filling', 'n.', 'Prepared wort added to ale to cleanse it.'),
(28432, 'Filliped', 'imp. & p. p.', 'of Fillip'),
(28433, 'Fillip', 'v. t.', 'To strike with the nail of the finger, first placed\n   against the ball of the thumb, and forced from that position with a\n   sudden spring; to snap with the finger.'),
(28434, 'Fillip', 'v. t.', 'To snap; to project quickly.'),
(28435, 'Fillip', 'n.', 'A jerk of the finger forced suddenly from the thumb; a\n   smart blow.'),
(28436, 'Fillip', 'n.', 'Something serving to rouse or excite.'),
(28437, 'Fillies', 'pl. ', 'of Filly'),
(28438, 'Filly', 'n.', 'A female foal or colt; a young mare. Cf. Colt, Foal.'),
(28439, 'Filly', 'n.', 'A lively, spirited young girl.'),
(28440, 'Filmy', 'a.', 'Composed of film or films.'),
(28441, 'Filose', 'a.', 'Terminating in a threadlike process.'),
(28442, 'Filter', 'n.', 'Any porous substance, as cloth, paper, sand, or charcoal,\n   through which water or other liquid may passed to cleanse it from the\n   solid or impure matter held in suspension; a chamber or device\n   containing such substance; a strainer; also, a similar device for\n   purifying air.'),
(28443, 'Filtered', 'imp. & p. p.', 'of Filter'),
(28444, 'Filter', 'n.', 'To purify or defecate, as water or other liquid, by causing\n   it to pass through a filter.'),
(28445, 'Filter', 'v. i.', 'To pass through a filter; to percolate.'),
(28446, 'Filter', 'n.', 'Same as Philter.'),
(28447, 'Filth', 'n.', 'Foul matter; anything that soils or defiles; dirt;\n   nastiness.'),
(28448, 'Filth', 'n.', 'Anything that sullies or defiles the moral character;\n   corruption; pollution.'),
(28449, 'Filthily', 'adv.', 'In a filthy manner; foully.'),
(28450, 'Filthy', 'superl.', 'Defiled with filth, whether material or moral; nasty;\n   dirty; polluted; foul; impure; obscene.'),
(28451, 'Filtrate', 'v. t.', 'To filter; to defecate; as liquid, by straining or\n   percolation.'),
(28452, 'Filtrate', 'n.', 'That which has been filtered; the liquid which has passed\n   through the filter in the process of filtration.'),
(28453, 'Finble', '', 'Alt. of Fimble hemp'),
(28454, 'Fimbriae', 'pl. ', 'of Fimbria'),
(28455, 'Fimbria', 'n.', 'A fringe, or fringed border.'),
(28456, 'Fimbria', 'n.', 'A band of white matter bordering the hippocampus in the\n   brain.'),
(28457, 'Finned', 'imp. & p. p.', 'of Fin'),
(28458, 'Finning', 'p. pr. & vb. n.', 'of Fin'),
(28459, 'Finable', 'a.', 'Liable or subject to a fine; as, a finable person or\n   offense.'),
(28460, 'Final', 'a.', 'Pertaining to the end or conclusion; last; terminating;\n   ultimate; as, the final day of a school term.'),
(28461, 'Final', 'a.', 'Conclusive; decisive; as, a final judgment; the battle of\n   Waterloo brought the contest to a final issue.'),
(28462, 'Final', 'a.', 'Respecting an end or object to be gained; respecting the\n   purpose or ultimate end in view.'),
(28463, 'Finale', 'n.', 'Close; termination'),
(28464, 'Finale', 'n.', 'The last movement of a symphony, sonata, concerto, or any\n   instrumental composition.'),
(28465, 'Finale', 'n.', 'The last composition performed in any act of an opera.'),
(28466, 'Finale', 'n.', 'The closing part, piece, or scene in any public performance\n   or exhibition.'),
(28467, 'Finality', 'n.', 'The state of being final, finished, or complete; a final\n   or conclusive arrangement; a settlement.'),
(28468, 'Finality', 'n.', 'The relation of end or purpose to its means.'),
(28469, 'Finally', 'adv.', 'At the end or conclusion; ultimately; lastly; as, the\n   contest was long, but the Romans finally conquered.'),
(28470, 'Finally', 'adv.', 'Completely; beyond recovery.'),
(28471, 'Finance', 'n.', 'The income of a ruler or of a state; revennue; public\n   money; sometimes, the income of an individual; often used in the plural\n   for funds; available money; resources.'),
(28472, 'Finance', 'n.', 'The science of raising and expending the public revenue.'),
(28473, 'Finary', 'n.', 'See Finery.'),
(28474, 'Finative', 'a.', 'Conclusive; decisive; definitive; final.'),
(28475, 'Finback', 'n.', 'Any whale of the genera Sibbaldius, Balaenoptera, and\n   allied genera, of the family Balaenopteridae, characterized by a\n   prominent fin on the back. The common finbacks of the New England coast\n   are Sibbaldius tectirostris and S. tuberosus.'),
(28476, 'Fishes', 'pl. ', 'of Finch'),
(28477, 'Finch', 'n.', 'A small singing bird of many genera and species, belonging\n   to the family Fringillidae.'),
(28478, 'Finched', 'a.', 'Same as Finchbacked.'),
(28479, 'Found', 'imp. & p. p.', 'of Find'),
(28480, 'Finding', 'p. pr. & vb. n.', 'of Find'),
(28481, 'Findable', 'a.', 'Capable of beong found; discoverable.'),
(28482, 'Finder', 'n.', 'One who, or that which, finds; specifically (Astron.), a\n   small telescope of low power and large field of view, attached to a\n   larger telescope, for the purpose of finding an object more readily.'),
(28483, 'Finding', 'n.', 'That which is found, come upon, or provided; esp. (pl.),\n   that which a journeyman artisan finds or provides for himself; as\n   tools, trimmings, etc.'),
(28484, 'Finding', 'n.', 'Support; maintenance; that which is provided for one;\n   expence; provision.'),
(28485, 'Finding', 'n.', 'The result of a judicial examination or inquiry,\n   especially into some matter of fact; a verdict; as, the finding of a\n   jury.'),
(28486, 'Findy', 'a.', 'Full; heavy; firm; solid; substemtial.'),
(28487, 'Fined', 'imp. & p. p.', 'of Fine'),
(28488, 'Fining', 'p. pr. & vb. n.', 'of Fine'),
(28489, 'Finedraw', 'v. t.', 'To sew up, so nicely that the seam is not perceived;\n   to renter.'),
(28490, 'Fineer', 'v. i.', 'To run in dept by getting goods made up in a way\n   unsuitable for the use of others, and then threatening not to take them\n   except on credit.'),
(28491, 'Fineer', 'v. t.', 'To veneer.'),
