(28728, 'Fixity', 'n.', 'Fixedness; as, fixity of tenure; also, that which is fixed.'),
(28729, 'Fixity', 'n.', 'Coherence of parts.'),
(28730, 'Fixture', 'n.', 'That which is fixed or attached to something as a\n   permanent appendage; as, the fixtures of a pump; the fixtures of a farm\n   or of a dwelling, that is, the articles which a tenant may not take\n   away.'),
(28731, 'Fixture', 'n.', 'State of being fixed; fixedness.'),
(28732, 'Fixture', 'n.', 'Anything of an accessory character annexed to houses and\n   lands, so as to constitute a part of them. This term is, however, quite\n   frequently used in the peculiar sense of personal chattels annexed to\n   lands and tenements, but removable by the person annexing them, or his\n   personal representatives. In this latter sense, the same things may be\n   fixtures under some circumstances, and not fixtures under others.'),
(28733, 'Fixure', 'n.', 'Fixed position; stable condition; firmness.'),
(28734, 'Fizgig', 'n.', 'A fishgig.'),
(28735, 'Fizgig', 'n.', 'A firework, made of damp powder, which makes a fizzing or\n   hissing noise when it explodes.'),
(28736, 'Fizgig', 'n.', 'A gadding, flirting girl.'),
(28737, 'Fizzed', 'imp. & p. p.', 'of Fizz'),
(28738, 'Fizzing', 'p. pr. & vb. n.', 'of Fizz'),
(28739, 'Fizzled', 'imp. & p. p.', 'of Fizzle'),
(28740, 'Fizzling', 'p. pr. & vb. n.', 'of Fizzle'),
(28741, 'Fizzle', 'v. i.', 'To make a hissing sound.'),
(28742, 'Fizzle', 'v. i.', 'To make a ridiculous failure in an undertaking.'),
(28743, 'Fizzle', 'n.', 'A failure or abortive effort.'),
(28744, 'Fjord', 'n.', 'See Fiord.'),
(28745, 'Flabbily', 'adv.', 'In a flabby manner.'),
(28746, 'Flabby', 'a.', 'Yielding to the touch, and easily moved or shaken; hanging\n   loose by its own weight; wanting firmness; flaccid; as, flabby flesh.'),
(28747, 'Flabel', 'n.', 'A fan.'),
(28748, 'Flabile', 'a.', 'Liable to be blown about.'),
(28749, 'Flaccid', 'a.', 'Yielding to pressure for want of firmness and stiffness;\n   soft and weak; limber; lax; drooping; flabby; as, a flaccid muscle;\n   flaccid flesh.'),
(28750, 'Flacker', 'v. i.', 'To flutter, as a bird.'),
(28751, 'Flacket', 'n.', 'A barrel-shaped bottle; a flagon.'),
(28752, 'Flagged', 'imp. & p. p.', 'of Flag'),
(28753, 'Flagging', 'p. pr. & vb. n.', 'of Flag'),
(28754, 'Flagella', 'pl. ', 'of Flagellum'),
(28755, 'Flagging', 'n.', 'A pavement or sidewalk of flagstones; flagstones,\n   collectively.'),
(28756, 'Flagging', 'a.', 'Growing languid, weak, or spiritless; weakening;\n   delaying.'),
(28757, 'Flaggy', 'a.', 'Weak; flexible; limber.'),
(28758, 'Flaggy', 'a.', 'Tasteless; insipid; as, a flaggy apple.'),
(28759, 'Flaggy', 'a.', 'Abounding with the plant called flag; as, a flaggy marsh.'),
(28760, 'Flagmen', 'pl. ', 'of Flagman'),
(28761, 'Flagman', 'n.', 'One who makes signals with a flag.'),
(28762, 'Flagon', 'n.', 'A vessel with a narrow mouth, used for holding and\n   conveying liquors. It is generally larger than a bottle, and of leather\n   or stoneware rather than of glass.'),
(28763, 'Flagrant', 'a.', 'Flaming; inflamed; glowing; burning; ardent.'),
(28764, 'Flagrant', 'a.', 'Actually in preparation, execution, or performance;\n   carried on hotly; raging.'),
(28765, 'Flagrant', 'a.', 'Flaming into notice; notorious; enormous; heinous;\n   glaringly wicked.'),
(28766, 'Flagrate', 'v. t.', 'To burn.'),
(28767, 'Flagship', 'n.', 'The vessel which carries the commanding officer of a\n   fleet or squadron and flies his distinctive flag or pennant.'),
(28768, '-staves', 'pl. ', 'of Flagstaff'),
(28769, '-staffs', 'pl. ', 'of Flagstaff'),
(28770, 'Flagworm', 'n.', 'A worm or grub found among flags and sedge.'),
(28771, 'Flail', 'n.', 'An instrument for threshing or beating grain from the ear by\n   hand, consisting of a wooden staff or handle, at the end of which a\n   stouter and shorter pole or club, called a swipe, is so hung as to\n   swing freely.'),
(28772, 'Flail', 'n.', 'An ancient military weapon, like the common flail, often\n   having the striking part armed with rows of spikes, or loaded.'),
(28773, 'Flaily', 'a.', 'Acting like a flail.'),
(28774, 'Flain', '', 'p. p. of Flay.'),
(28775, 'Flake', 'n.', 'A paling; a hurdle.'),
(28776, 'Flake', 'n.', 'A platform of hurdles, or small sticks made fast or\n   interwoven, supported by stanchions, for drying codfish and other\n   things.'),
(28777, 'Flake', 'n.', 'A small stage hung over a vessel\'s side, for workmen to\n   stand on in calking, etc.'),
(28778, 'Flake', 'n.', 'A loose filmy mass or a thin chiplike layer of anything; a\n   film; flock; lamina; layer; scale; as, a flake of snow, tallow, or\n   fish.'),
(28779, 'Flake', 'n.', 'A little particle of lighted or incandescent matter, darted\n   from a fire; a flash.'),
(28780, 'Flake', 'n.', 'A sort of carnation with only two colors in the flower, the\n   petals having large stripes.'),
(28781, 'Flaked', 'imp. & p. p.', 'of Flake'),
(28782, 'Flaking', 'p. pr. & vb. n.', 'of Flake'),
(28783, 'Flake', 'v. t.', 'To form into flakes.'),
(28784, 'Flake', 'v. i.', 'To separate in flakes; to peel or scale off.'),
(28785, 'Flaky', 'a.', 'Consisting of flakes or of small, loose masses; lying, or\n   cleaving off, in flakes or layers; flakelike.'),
(28786, 'Flammed', 'imp. & p. p.', 'of Flam'),
(28787, 'Flamming', 'p. pr. & vb. n.', 'of Flam'),
(28788, 'Flambeau', 'n.', 'A flaming torch, esp. one made by combining together a\n   number of thick wicks invested with a quick-burning substance\n   (anciently, perhaps, wax; in modern times, pitch or the like); hence,\n   any torch.'),
(28789, 'Flame', 'n.', 'A stream of burning vapor or gas, emitting light and heat;\n   darting or streaming fire; a blaze; a fire.'),
(28790, 'Flame', 'n.', 'Burning zeal or passion; elevated and noble enthusiasm;\n   glowing imagination; passionate excitement or anger.'),
(28791, 'Flame', 'n.', 'Ardor of affection; the passion of love.'),
(28792, 'Flame', 'n.', 'A person beloved; a sweetheart.'),
(28793, 'Flamed', 'imp. & p. p.', 'of Flame'),
(28794, 'Flaming', 'p. pr. & vb. n.', 'of Flame'),
(28795, 'Flame', 'n.', 'To burn with a flame or blaze; to burn as gas emitted from\n   bodies in combustion; to blaze.'),
(28796, 'Flame', 'n.', 'To burst forth like flame; to break out in violence of\n   passion; to be kindled with zeal or ardor.'),
(28797, 'Flame', 'v. t.', 'To kindle; to inflame; to excite.'),
(28798, 'Flamelet', 'n.', 'A small flame.'),
(28799, 'Flammens', 'pl. ', 'of Flamen'),
(28800, 'Flamines', 'pl. ', 'of Flamen'),
(28801, 'Flamen', 'n.', 'A priest devoted to the service of a particular god, from\n   whom he received a distinguishing epithet. The most honored were those\n   of Jupiter, Mars, and Quirinus, called respectively Flamen Dialis,\n   Flamen Martialis, and Flamen Quirinalis.'),
(28802, 'Flaming', 'a.', 'Emitting flames; afire; blazing; consuming; illuminating.'),
(28803, 'Flaming', 'a.', 'Of the color of flame; high-colored; brilliant; dazzling.'),
(28804, 'Flaming', 'a.', 'Ardent; passionate; burning with zeal; irrepressibly\n   earnest; as, a flaming proclomation or harangue.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(28805, 'Flamingo', 'n.', 'Any bird of the genus Phoenicopterus. The flamingoes have\n   webbed feet, very long legs, and a beak bent down as if broken. Their\n   color is usually red or pink. The American flamingo is P. ruber; the\n   European is P. antiquorum.'),
(28806, 'Flamy', 'a.', 'Flaming; blazing; flamelike; flame-colored; composed of\n   flame.'),
(28807, 'Flanches', 'pl. ', 'of Flanch'),
(28808, 'Flanch', 'n.', 'A flange.'),
(28809, 'Flanch', 'n.', 'A bearing consisting of a segment of a circle encroaching\n   on the field from the side.'),
(28810, 'Flanched', 'a.', 'Having flanches; -- said of an escutcheon with those\n   bearings.'),
(28811, 'Flaneur', 'n.', 'One who strolls about aimlessly; a lounger; a loafer.'),
(28812, 'Flang', 'n.', 'A miner\'s two-pointed pick.'),
(28813, 'Flange', 'n.', 'An external or internal rib, or rim, for strength, as the\n   flange of an iron beam; or for a guide, as the flange of a car wheel\n   (see Car wheel.); or for attachment to another object, as the flange on\n   the end of a pipe, steam cylinder, etc.'),
(28814, 'Flange', 'n.', 'A plate or ring to form a rim at the end of a pipe when\n   fastened to the pipe.'),
(28815, 'Flanged', 'imp. & p. p.', 'of Flange'),
(28816, 'Flanging', 'p. pr. & vb. n.', 'of Flange'),
(28817, 'Flange', 'v. t.', 'To make a flange on; to furnish with a flange.'),
(28818, 'Flange', 'v. i.', 'To be bent into a flange.'),
(28819, 'Flanged', 'a.', 'Having a flange or flanges; as, a flanged wheel.'),
(28820, 'Flank', 'n.', 'The fleshy or muscular part of the side of an animal,\n   between the ribs and the hip. See Illust. of Beef.'),
(28821, 'Flank', 'n.', 'The side of an army, or of any division of an army, as of a\n   brigade, regiment, or battalion; the extreme right or left; as, to\n   attack an enemy in flank is to attack him on the side.'),
(28822, 'Flank', 'n.', 'That part of a bastion which reaches from the curtain to the\n   face, and defends the curtain, the flank and face of the opposite\n   bastion; any part of a work defending another by a fire along the\n   outside of its parapet.'),
(28823, 'Flank', 'n.', 'The side of any building.'),
(28824, 'Flank', 'n.', 'That part of the acting surface of a gear wheel tooth that\n   lies within the pitch line.'),
(28825, 'Flanked', 'imp. & p. p.', 'of Flank'),
(28826, 'Flanking', 'p. pr. & vb. n.', 'of Flank'),
(28827, 'Flank', 'v. t.', 'To stand at the flank or side of; to border upon.'),
(28828, 'Flank', 'v. t.', 'To overlook or command the flank of; to secure or guard\n   the flank of; to pass around or turn the flank of; to attack, or\n   threaten to attack; the flank of.'),
(28829, 'Flank', 'v. i.', 'To border; to touch.'),
(28830, 'Flank', 'v. i.', 'To be posted on the side.'),
(28831, 'Flanker', 'n.', 'One who, or that which, flanks, as a skirmisher or a body\n   of troops sent out upon the flanks of an army toguard a line of march,\n   or a fort projecting so as to command the side of an assailing body.'),
(28832, 'Flanker', 'v. t.', 'To defend by lateral fortifications.'),
(28833, 'Flanker', 'v. t.', 'To attack sideways.'),
(28834, 'Flannel', 'n.', 'A soft, nappy, woolen cloth, of loose texture.'),
(28835, 'Flannen', 'a.', 'Made or consisting of flannel.'),
(28836, 'Flapped', 'imp. & p. p.', 'of Flap'),
(28837, 'Flapping', 'p. pr. & vb. n.', 'of Flap'),
(28838, 'Flapjack', 'n.', 'A fklat cake turned on the griddle while cooking; a\n   griddlecake or pacake.'),
(28839, 'Flapjack', 'n.', 'A fried dough cake containing fruit; a turnover.'),
(28840, 'Flapper', 'n.', 'One who, or that which, flaps.'),
(28841, 'Flapper', 'n.', 'See Flipper.'),
(28842, 'Flared', 'imp. & p. p.', 'of Flare'),
(28843, 'Flaring', 'p. pr. & vb. n.', 'of Flare'),
(28844, 'Flare', 'v. i.', 'To burn with an unsteady or waving flame; as, the candle\n   flares.'),
(28845, 'Flare', 'v. i.', 'To shine out with a sudden and unsteady light; to emit a\n   dazzling or painfully bright light.'),
(28846, 'Flare', 'v. i.', 'To shine out with gaudy colors; to flaunt; to be\n   offensively bright or showy.'),
(28847, 'Flare', 'v. i.', 'To be exposed to too much light.'),
(28848, 'Flare', 'v. i.', 'To open or spread outwards; to project beyond the\n   perpendicular; as, the sides of a bowl flare; the bows of a ship flare.'),
(28849, 'Flare', 'n.', 'An unsteady, broad, offensive light.'),
(28850, 'Flare', 'n.', 'A spreading outward; as, the flare of a fireplace.'),
(28851, 'Flare', 'n.', 'Leaf of lard.'),
(28852, 'Flare-up', 'n.', 'A sudden burst of anger or passion; an angry dispute.'),
(28853, 'Flaring', 'a.', 'That flares; flaming or blazing unsteadily; shining out\n   with a dazzling light.'),
(28854, 'Flaring', 'a.', 'Opening or speading outwards.'),
(28855, 'Flashed', 'imp. & p. p.', 'of Flash'),
(28856, 'Flashing', 'p. pr. & vb. n.', 'of Flash'),
(28857, 'Flash', 'v. i.', 'To burst or break forth with a sudden and transient flood\n   of flame and light; as, the lighting flashes vividly; the powder\n   flashed.'),
(28858, 'Flash', 'v. i.', 'To break forth, as a sudden flood of light; to burst\n   instantly and brightly on the sight; to show a momentary brilliancy; to\n   come or pass like a flash.'),
(28859, 'Flash', 'v. i.', 'To burst forth like a sudden flame; to break out\n   violently; to rush hastily.'),
(28860, 'Flash', 'v. t.', 'To send out in flashes; to cause to burst forth with\n   sudden flame or light.'),
(28861, 'Flash', 'v. t.', 'To convey as by a flash; to light up, as by a sudden\n   flame or light; as, to flash a message along the wires; to flash\n   conviction on the mind.'),
(28862, 'Flash', 'v. t.', 'To cover with a thin layer, as objects of glass with\n   glass of a different color. See Flashing, n., 3 (b).'),
(28863, 'Flash', 'n.', 'To trick up in a showy manner.'),
(28864, 'Flash', 'n.', 'To strike and throw up large bodies of water from the\n   surface; to splash.'),
(28865, 'Flashes', 'pl. ', 'of Flash'),
(28866, 'Flash', 'n.', 'A sudden burst of light; a flood of light instantaneously\n   appearing and disappearing; a momentary blaze; as, a flash of\n   lightning.'),
(28867, 'Flash', 'n.', 'A sudden and brilliant burst, as of wit or genius; a\n   momentary brightness or show.'),
(28868, 'Flash', 'n.', 'The time during which a flash is visible; an instant; a very\n   brief period.'),
(28869, 'Flash', 'n.', 'A preparation of capsicum, burnt sugar, etc., for coloring\n   and giving a fictious strength to liquors.'),
(28870, 'Flash', 'a.', 'Showy, but counterfeit; cheap, pretentious, and vulgar; as,\n   flash jewelry; flash finery.'),
(28871, 'Flash', 'a.', 'Wearing showy, counterfeit ornaments; vulgarly pretentious;\n   as, flash people; flash men or women; -- applied especially to thieves,\n   gamblers, and prostitutes that dress in a showy way and wear much cheap\n   jewelry.'),
(28872, 'Flash', 'n.', 'Slang or cant of thieves and prostitutes.'),
(28873, 'Flash', 'n.', 'A pool.'),
(28874, 'Flash', 'n.', 'A reservoir and sluiceway beside a navigable stream, just\n   above a shoal, so that the stream may pour in water as boats pass, and\n   thus bear them over the shoal.'),
(28875, 'Flasher', 'n.', 'One who, or that which, flashes.'),
(28876, 'Flasher', 'n.', 'A man of more appearance of wit than reality.'),
(28877, 'Flasher', 'n.', 'A large sparoid fish of the Atlantic coast and all\n   tropical seas (Lobotes Surinamensis).'),
(28878, 'Flasher', 'n.', 'The European red-backed shrike (Lanius collurio); --\n   called also flusher.'),
(28879, 'Flashily', 'adv.', 'In a flashy manner; with empty show.'),
(28880, 'Flashing', 'n.', 'The creation of an artifical flood by the sudden letting\n   in of a body of water; -- called also flushing.'),
(28881, 'Flashing', 'n.', 'Pieces of metal, built into the joints of a wall, so as\n   to lap over the edge of the gutters or to cover the edge of the\n   roofing; also, similar pieces used to cover the valleys of roofs of\n   slate, shingles, or the like. By extension, the metal covering of\n   ridges and hips of roofs; also, in the United States, the protecting of\n   angles and breaks in walls of frame houses with waterproof material,\n   tarred paper, or the like. Cf. Filleting.'),
(28882, 'Flashing', 'n.', 'The reheating of an article at the furnace aperture\n   during manufacture to restore its plastic condition; esp., the\n   reheating of a globe of crown glass to allow it to assume a flat shape\n   as it is rotated.'),
(28883, 'Flashing', 'n.', 'A mode of covering transparent white glass with a film of\n   colored glass.'),
(28884, 'Flashy', 'a.', 'Dazzling for a moment; making a momentary show of\n   brilliancy; transitorily bright.'),
(28885, 'Flashy', 'a.', 'Fiery; vehement; impetuous.'),
(28886, 'Flashy', 'a.', 'Showy; gay; gaudy; as, a flashy dress.'),
(28887, 'Flashy', 'a.', 'Without taste or spirit.'),
(28888, 'Flask', 'n.', 'A small bottle-shaped vessel for holding fluids; as, a flask\n   of oil or wine.'),
(28889, 'Flask', 'n.', 'A narrow-necked vessel of metal or glass, used for various\n   purposes; as of sheet metal, to carry gunpowder in; or of wrought iron,\n   to contain quicksilver; or of glass, to heat water in, etc.'),
(28890, 'Flask', 'n.', 'A bed in a gun carriage.'),
(28891, 'Flask', 'n.', 'The wooden or iron frame which holds the sand, etc., forming\n   the mold used in a foundry; it consists of two or more parts; viz., the\n   cope or top; sometimes, the cheeks, or middle part; and the drag, or\n   bottom part. When there are one or more cheeks, the flask is called a\n   three part flask, four part flask, etc.'),
(28892, 'Flasket', 'n.', 'A long, shallow basket, with two handles.'),
(28893, 'Flasket', 'n.', 'A small flask.'),
(28894, 'Flasket', 'n.', 'A vessel in which viands are served.'),
(28895, 'Flatted', 'imp. & p. p.', 'of Flat'),
(28896, 'Flatting', 'p. pr. & vb. n.', 'of Flat'),
(28897, 'Flatbill', 'n.', 'Any bird of the genus Flatyrynchus. They belong to the\n   family of flycatchers.'),
(28898, 'Flatboat', 'n.', 'A boat with a flat bottom and square ends; -- used for\n   the transportation of bulky freight, especially in shallow waters.'),
(28899, 'Flat-cap', 'n.', 'A kind of low-crowned cap formerly worn by all classes in\n   England, and continued in London after disuse elsewhere; -- hence, a\n   citizen of London.'),
(28900, 'Flatfish', 'n.', 'Any fish of the family Pleuronectidae; esp., the winter\n   flounder (Pleuronectes Americanus). The flatfishes have the body\n   flattened, swim on the side, and have eyes on one side, as the\n   flounder, turbot, and halibut. See Flounder.'),
(28901, 'Flathead', 'a.', 'Characterized by flatness of head, especially that\n   produced by artificial means, as a certain tribe of American Indians.'),
(28902, 'Flathead', 'n.', 'A Chinook Indian. See Chinook, n., 1.'),
(28903, 'Flatiron', 'n.', 'An iron with a flat, smooth surface for ironing clothes.'),
(28904, 'Flative', 'a.', 'Producing wind; flatulent.'),
(28905, 'Flating', 'a.', 'With the flat side, as of a sword; flatlong; in a\n   prostrate position.'),
(28906, 'Flatlong', 'adv.', 'With the flat side downward; not edgewise.'),
(28907, 'Flatly', 'adv.', 'In a flat manner; evenly; horizontally; without spirit;\n   dully; frigidly; peremptorily; positively, plainly.'),
(28908, 'Flatness', 'n.', 'The quality or state of being flat.'),
(28909, 'Flatness', 'n.', 'Eveness of surface; want of relief or prominence; the\n   state of being plane or level.'),
(28910, 'Flatness', 'n.', 'Want of vivacity or spirit; prostration; dejection;\n   depression.'),
(28911, 'Flatness', 'n.', 'Want of variety or flavor; dullness; insipidity.'),
(28912, 'Flatness', 'n.', 'Depression of tone; the state of being below the true\n   pitch; -- opposed to sharpness or acuteness.'),
(28913, 'Flatour', 'n.', 'A flatterer.'),
(28914, 'Flatten', 'a.', 'To reduce to an even surface or one approaching evenness;\n   to make flat; to level; to make plane.'),
(28915, 'Flatten', 'a.', 'To throw down; to bring to the ground; to prostrate;\n   hence, to depress; to deject; to dispirit.'),
(28916, 'Flatten', 'a.', 'To make vapid or insipid; to render stale.'),
(28917, 'Flatten', 'a.', 'To lower the pitch of; to cause to sound less sharp; to\n   let fall from the pitch.'),
(28918, 'Flatten', 'v. i.', 'To become or grow flat, even, depressed dull, vapid,\n   spiritless, or depressed below pitch.'),
(28919, 'Flatter', 'n.', 'One who, or that which, makes flat or flattens.'),
(28920, 'Flatter', 'n.', 'A flat-faced fulling hammer.'),
(28921, 'Flatter', 'n.', 'A drawplate with a narrow, rectangular orifice, for\n   drawing flat strips, as watch springs, etc.'),
(28922, 'Flatter', 'v. t.', 'To treat with praise or blandishments; to gratify or\n   attempt to gratify the self-love or vanity of, esp. by artful and\n   interested commendation or attentions; to blandish; to cajole; to\n   wheedle.'),
(28923, 'Flatter', 'v. t.', 'To raise hopes in; to encourage or favorable, but\n   sometimes unfounded or deceitful, representations.'),
(28924, 'Flatter', 'v. t.', 'To portray too favorably; to give a too favorable idea\n   of; as, his portrait flatters him.'),
(28925, 'Flatter', 'v. i.', 'To use flattery or insincere praise.'),
(28926, 'Flattery', 'v. t.', 'The act or practice of flattering; the act of pleasing\n   by artiful commendation or compliments; adulation; false, insincere, or\n   excessive praise.'),
(28927, 'Flatting', 'n.', 'The process or operation of making flat, as a cylinder of\n   glass by opening it out.'),
(28928, 'Flatting', 'n.', 'A mode of painting,in which the paint, being mixed with\n   turpentine, leaves the work without gloss.'),
(28929, 'Flatting', 'n.', 'A method of preserving gilding unburnished, by touching\n   with size.'),
(28930, 'Flatting', 'n.', 'The process of forming metal into sheets by passing it\n   between rolls.'),
(28931, 'Flattish', 'a.', 'Somewhat flat.'),
(28932, 'Flatuous', 'a.', 'Windy; generating wind.'),
(28933, 'Flatuses', 'pl. ', 'of Flatus'),
(28934, 'Flatus', 'pl. ', 'of Flatus'),
(28935, 'Flatus', 'n.', 'A breath; a puff of wind.'),
(28936, 'Flatus', 'n.', 'Wind or gas generated in the stomach or other cavities of\n   the body.'),
(28937, 'Flatware', 'n.', 'Articles for the table, as china or silverware, that are\n   more or less flat, as distinguished from hollow ware.'),
(28938, 'Flatwise', 'a. / adv.', 'With the flat side downward, or next to another\n   object; not edgewise.'),
(28939, 'Flatworm', 'n.', 'Any worm belonging to the Plathelminthes; also, sometimes\n   applied to the planarians.'),
(28940, 'Flaunted', 'imp. & p. p.', 'of Flaunt'),
(28941, 'Flaunt', 'v. i.', 'To throw or spread out; to flutter; to move\n   ostentatiously; as, a flaunting show.'),
(28942, 'Flaunt', 'v. t.', 'To display ostentatiously; to make an impudent show of.'),
(28943, 'Flaunt', 'n.', 'Anything displayed for show.'),
(28944, 'Flautist', 'n.', 'A player on the flute; a flutist.'),
(28945, 'Flauto', 'n.', 'A flute.'),
(28946, 'Flavin', 'n.', 'A yellow, vegetable dyestuff, resembling quercitron.'),
(28947, 'Flavine', 'n.', 'A yellow, crystalline, organic base, C13H12N2O, obtained\n   artificially.'),
(28948, 'Flavol', 'n.', 'A yellow, crystalline substance, obtained from\n   anthraquinone, and regarded as a hydroxyl derivative of it.'),
(28949, 'Flavor', 'n.', 'That quality of anything which affects the smell; odor;\n   fragrances; as, the flavor of a rose.'),
(28950, 'Flavor', 'n.', 'That quality of anything which affects the taste; that\n   quality which gratifies the palate; relish; zest; savor; as, the flavor\n   of food or drink.'),
(28951, 'Flavor', 'n.', 'That which imparts to anything a peculiar odor or taste,\n   gratifying to the sense of smell, or the nicer perceptions of the\n   palate; a substance which flavors.'),
(28952, 'Flavor', 'n.', 'That quality which gives character to any of the\n   productions of literature or the fine arts.'),
(28953, 'Flavored', 'imp. & p. p.', 'of Flavor'),
(28954, 'Flavor', 'v. t.', 'To give flavor to; to add something (as salt or a spice)\n   to, to give character or zest.'),
(28955, 'Flavored', 'a.', 'Having a distinct flavor; as, high-flavored wine.'),
(28956, 'Flavous', 'a.', 'Yellow.'),
