(29194, 'Float', 'v. i.', 'A contrivance for affording a copious stream of water to\n   the heated surface of an object of large bulk, as an anvil or die.'),
(29195, 'Float', 'v. i.', 'The act of flowing; flux; flow.'),
(29196, 'Float', 'v. i.', 'A quantity of earth, eighteen feet square and one foot\n   deep.'),
(29197, 'Float', 'v. i.', 'The trowel or tool with which the floated coat of\n   plastering is leveled and smoothed.'),
(29198, 'Float', 'v. i.', 'A polishing block used in marble working; a runner.'),
(29199, 'Float', 'v. i.', 'A single-cut file for smoothing; a tool used by\n   shoemakers for rasping off pegs inside a shoe.'),
(29200, 'Float', 'v. i.', 'A coal cart.'),
(29201, 'Float', 'v. i.', 'The sea; a wave. See Flote, n.'),
(29202, 'Floated', 'imp. & p. p.', 'of Float'),
(29203, 'Floating', 'p. pr. & vb. n.', 'of Float'),
(29204, 'Float', 'n.', 'To rest on the surface of any fluid; to swim; to be buoyed\n   up.'),
(29205, 'Float', 'n.', 'To move quietly or gently on the water, as a raft; to drift\n   along; to move or glide without effort or impulse on the surface of a\n   fluid, or through the air.'),
(29206, 'Float', 'v. t.', 'To cause to float; to cause to rest or move on the\n   surface of a fluid; as, the tide floated the ship into the harbor.'),
(29207, 'Float', 'v. t.', 'To flood; to overflow; to cover with water.'),
(29208, 'Float', 'v. t.', 'To pass over and level the surface of with a float while\n   the plastering is kept wet.'),
(29209, 'Float', 'v. t.', 'To support and sustain the credit of, as a commercial\n   scheme or a joint-stock company, so as to enable it to go into, or\n   continue in, operation.'),
(29210, 'Floatage', 'n.', 'Same as Flotage.'),
(29211, 'Floater', 'n.', 'One who floats or swims.'),
(29212, 'Floater', 'n.', 'A float for indicating the height of a liquid surface.'),
(29213, 'Floating', 'a.', 'Buoyed upon or in a fluid; a, the floating timbers of a\n   wreck; floating motes in the air.'),
(29214, 'Floating', 'a.', 'Free or lose from the usual attachment; as, the floating\n   ribs in man and some other animals.'),
(29215, 'Floating', 'a.', 'Not funded; not fixed, invested, or determined; as,\n   floating capital; a floating debt.'),
(29216, 'Floating', 'n.', 'Floating threads. See Floating threads, above.'),
(29217, 'Floating', 'n.', 'The second coat of three-coat plastering.'),
(29218, 'Floaty', 'a.', 'Swimming on the surface; buoyant; light.'),
(29219, 'Flobert', 'n.', 'A small cartridge designed for target shooting; --\n   sometimes called ball cap.'),
(29220, 'Floccose', 'n.', 'Spotted with small tufts like wool.'),
(29221, 'Floccose', 'n.', 'Having tufts of soft hairs, which are often deciduous.'),
(29222, 'Flocculi', 'pl. ', 'of Flocculus'),
(29223, 'Flocci', 'pl. ', 'of Floccus'),
(29224, 'Floccus', 'n.', 'The tuft of hair terminating the tail of mammals.'),
(29225, 'Floccus', 'n.', 'A tuft of feathers on the head of young birds.'),
(29226, 'Floccus', 'n.', 'A woolly filament sometimes occuring with the sporules of\n   certain fungi.'),
(29227, 'Flock', 'n.', 'A company or collection of living creatures; -- especially\n   applied to sheep and birds, rarely to persons or (except in the plural)\n   to cattle and other large animals; as, a flock of ravenous fowl.'),
(29228, 'Flock', 'n.', 'A Christian church or congregation; considered in their\n   relation to the pastor, or minister in charge.'),
(29229, 'Flocked', 'imp. & p. p.', 'of Flock'),
(29230, 'Flocking', 'p. pr. & vb. n.', 'of Flock'),
(29231, 'Flock', 'v. i.', 'To gather in companies or crowds.'),
(29232, 'Flock', 'v. t.', 'To flock to; to crowd.'),
(29233, 'Flock', 'n.', 'A lock of wool or hair.'),
(29234, 'Flock', 'n.', 'Woolen or cotton refuse (sing. / pl.), old rags, etc.,\n   reduced to a degree of fineness by machinery, and used for stuffing\n   unpholstered furniture.'),
(29235, 'Flock', 'sing. / pl.', 'Very fine, sifted, woolen refuse, especially that\n   from shearing the nap of cloths, used as a coating for wall paper to\n   give it a velvety or clothlike appearance; also, the dust of vegetable\n   fiber used for a similar purpose.'),
(29236, 'Flock', 'v. t.', 'To coat with flock, as wall paper; to roughen the surface\n   of (as glass) so as to give an appearance of being covered with fine\n   flock.'),
(29237, 'Flockly', 'adv.', 'In flocks; in crowds.'),
(29238, 'Flockmel', 'adv.', 'In a flock; in a body.'),
(29239, 'Flocky', 'a.', 'Abounding with flocks; floccose.'),
(29240, 'Flogged', 'imp. & p. p.', 'of Flog'),
(29241, 'Flogging', 'p. pr. & vb. n.', 'of Flog'),
(29242, 'Flogger', 'n.', 'One who flogs.'),
(29243, 'Flogger', 'n.', 'A kind of mallet for beating the bung stave of a cask to\n   start the bung.'),
(29244, 'Flogging', 'a. & n.', 'from Flog, v. t.'),
(29245, 'Flong', '', 'imp. & p. p. of Fling.'),
(29246, 'Flood', 'v. i.', 'A great flow of water; a body of moving water; the\n   flowing stream, as of a river; especially, a body of water, rising,\n   swelling, and overflowing land not usually thus covered; a deluge; a\n   freshet; an inundation.'),
(29247, 'Flood', 'v. i.', 'The flowing in of the tide; the semidiurnal swell or rise\n   of water in the ocean; -- opposed to ebb; as, young flood; high flood.'),
(29248, 'Flood', 'v. i.', 'A great flow or stream of any fluid substance; as, a\n   flood of light; a flood of lava; hence, a great quantity widely\n   diffused; an overflowing; a superabundance; as, a flood of bank notes;\n   a flood of paper currency.'),
(29249, 'Flood', 'v. i.', 'Menstrual disharge; menses.'),
(29250, 'Flooded', 'imp. & p. p.', 'of Flood'),
(29251, 'Flooding', 'p. pr. & vb. n.', 'of Flood'),
(29252, 'Flood', 'v. t.', 'To overflow; to inundate; to deluge; as, the swollen\n   river flooded the valley.'),
(29253, 'Flood', 'v. t.', 'To cause or permit to be inundated; to fill or cover with\n   water or other fluid; as, to flood arable land for irrigation; to fill\n   to excess or to its full capacity; as, to flood a country with a\n   depreciated currency.'),
(29254, 'Floodage', 'n.', 'Inundation.'),
(29255, 'Flooder', 'n.', 'One who floods anything.'),
(29256, 'Flooding', 'n.', 'The filling or covering with water or other fluid;\n   overflow; inundation; the filling anything to excess.'),
(29257, 'Flooding', 'n.', 'An abnormal or excessive discharge of blood from the\n   uterus.'),
(29258, 'Flook', 'n.', 'A fluke of an anchor.'),
(29259, 'Flookan', 'n.', 'Alt. of Flukan'),
(29260, 'Flukan', 'n.', 'See Flucan.'),
(29261, 'Flooky', 'a.', 'Fluky.'),
(29262, 'Floor', 'n.', 'The bottom or lower part of any room; the part upon which we\n   stand and upon which the movables in the room are supported.'),
(29263, 'Floor', 'n.', 'The structure formed of beams, girders, etc., with proper\n   covering, which divides a building horizontally into stories. Floor in\n   sense 1 is, then, the upper surface of floor in sense 2.'),
(29264, 'Floor', 'n.', 'The surface, or the platform, of a structure on which we\n   walk or travel; as, the floor of a bridge.'),
(29265, 'Floor', 'n.', 'A story of a building. See Story.'),
(29266, 'Floor', 'n.', 'The part of the house assigned to the members.'),
(29267, 'Floor', 'n.', 'The right to speak.'),
(29268, 'Floor', 'n.', 'That part of the bottom of a vessel on each side of the\n   keelson which is most nearly horizontal.'),
(29269, 'Floor', 'n.', 'The rock underlying a stratified or nearly horizontal\n   deposit.'),
(29270, 'Floor', 'n.', 'A horizontal, flat ore body.'),
(29271, 'Floored', 'imp. & p. p.', 'of Floor'),
(29272, 'Flooring', 'p. pr. & vb. n.', 'of Floor'),
(29273, 'Floor', 'v. t.', 'To cover with a floor; to furnish with a floor; as, to\n   floor a house with pine boards.'),
(29274, 'Floor', 'v. t.', 'To strike down or lay level with the floor; to knock\n   down; hence, to silence by a conclusive answer or retort; as, to floor\n   an opponent.'),
(29275, 'Floor', 'v. t.', 'To finish or make an end of; as, to floor a college\n   examination.'),
(29276, 'Floorage', 'n.', 'Floor space.'),
(29277, 'Floorer', 'n.', 'Anything that floors or upsets a person, as a blow that\n   knocks him down; a conclusive answer or retort; a task that exceeds\n   one\'s abilities.'),
(29278, 'Flooring', 'n.', 'A platform; the bottom of a room; a floor; pavement. See\n   Floor, n.'),
(29279, 'Flooring', 'n.', 'Material for the construction of a floor or floors.'),
(29280, 'Flopped', 'imp. & p. p.', 'of Flop'),
(29281, 'Flopping', 'p. pr. & vb. n.', 'of Flop'),
(29282, 'Floppy', 'n.', 'Having a tendency to flop or flap; as, a floppy hat brim.'),
(29283, 'Flopwing', 'n.', 'The lapwing.'),
(29284, 'Flora', 'n.', 'The goddess of flowers and spring.'),
(29285, 'Flora', 'n.', 'The complete system of vegetable species growing without\n   cultivation in a given locality, region, or period; a list or\n   description of, or treatise on, such plants.'),
(29286, 'Floral', 'a.', 'Pertaining to Flora, or to flowers; made of flowers; as,\n   floral games, wreaths.'),
(29287, 'Floral', 'a.', 'Containing, or belonging to, a flower; as, a floral bud; a\n   floral leaf; floral characters.'),
(29288, 'Florally', 'adv.', 'In a floral manner.'),
(29289, 'Floran', 'n.', 'Tin ore scarcely perceptible in the stone; tin ore stamped\n   very fine.'),
(29290, 'Floreal', 'n.', 'The eight month of the French republican calendar. It\n   began April 20, and ended May 19. See Vendemiare.'),
(29291, 'Floren', 'n.', 'A cerain gold coin; a Florence.'),
(29292, 'Florence', 'n.', 'An ancient gold coin of the time of Edward III., of six\n   shillings sterling value.'),
(29293, 'Florence', 'n.', 'A kind of cloth.'),
(29294, 'Floret', 'n.', 'A little flower; one of the numerous little flowers which\n   compose the head or anthodium in such flowers as the daisy, thistle,\n   and dandelion.'),
(29295, 'Floret', 'n.', 'A foil; a blunt sword used in fencing.'),
(29296, 'Floriage', 'n.', 'Bloom; blossom.'),
(29297, 'Florid', 'a.', 'Covered with flowers; abounding in flowers; flowery.'),
(29298, 'Florid', 'a.', 'Bright in color; flushed with red; of a lively reddish\n   color; as, a florid countenance.'),
(29299, 'Florid', 'a.', 'Embellished with flowers of rhetoric; enriched to excess\n   with figures; excessively ornate; as, a florid style; florid eloquence.'),
(29300, 'Florid', 'a.', 'Flowery; ornamental; running in rapid melodic figures,\n   divisions, or passages, as in variations; full of fioriture or little\n   ornamentations.'),
(29301, 'Floridly', 'adv.', 'In a florid manner.'),
(29302, 'Floriken', 'n.', 'An Indian bustard (Otis aurita). The Bengal floriken is\n   Sypheotides Bengalensis.'),
(29303, 'Florimer', 'n.', 'See Floramour.'),
(29304, 'Florin', 'n.', 'A silver coin of Florence, first struck in the twelfth\n   century, and noted for its beauty. The name is given to different coins\n   in different countries. The florin of England, first minted in 1849, is\n   worth two shillings, or about 48 cents; the florin of the Netherlands,\n   about 40 cents; of Austria, about 36 cents.'),
(29305, 'Florist', 'n.', 'A cultivator of, or dealer in, flowers.'),
(29306, 'Florist', 'n.', 'One who writes a flora, or an account of plants.'),
(29307, 'Floroon', 'n.', 'A border worked with flowers.'),
(29308, 'Floscule', 'n.', 'A floret.'),
(29309, 'Flosh', 'n.', 'A hopper-shaped box or /nortar in which ore is placed for\n   the action of the stamps.'),
(29310, 'Floss', 'n.', 'The slender styles of the pistillate flowers of maize; also\n   called silk.'),
(29311, 'Floss', 'n.', 'Untwisted filaments of silk, used in embroidering.'),
(29312, 'Floss', 'n.', 'A small stream of water.'),
(29313, 'Floss', 'n.', 'Fluid glass floating on iron in the puddling furnace,\n   produced by the vitrification of oxides and earths which are present.'),
(29314, 'Flossy', 'a.', 'Pertaining to, made of, or resembling, floss; hence, light;\n   downy.'),
(29315, 'Flota', 'n.', 'A fleet; especially, a /eet of Spanish ships which formerly\n   sailed every year from Cadiz to Vera Cruz, in Mexico, to transport to\n   Spain the production of Spanish America.'),
(29316, 'Flotage', 'n.', 'The state of floating.'),
(29317, 'Flotage', 'n.', 'That which floats on the sea or in rivers.'),
(29318, 'Flotant', 'a.', 'Represented as flying or streaming in the air; as, a\n   banner flotant.'),
(29319, 'Flote', 'v. t.', 'To fleet; to skim.'),
(29320, 'Flote', 'n.', 'A wave.'),
(29321, 'Flotery', 'a.', 'Wavy; flowing.'),
(29322, 'Flotilla', 'n.', 'A little fleet, or a fleet of small vessels.'),
(29323, 'Flotsam', 'n.', 'Alt. of Flotson'),
(29324, 'Flotson', 'n.', 'Goods lost by shipwreck, and floating on the sea; -- in\n   distinction from jetsam or jetson.'),
(29325, 'Flotten', 'v. t.', 'Skimmed.'),
(29326, 'Flounced', 'imp. & p. p.', 'of Flounce');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(29327, 'Flounce', 'v. i.', 'To throw the limbs and body one way and the other; to\n   spring, turn, or twist with sudden effort or violence; to struggle, as\n   a horse in mire; to flounder; to throw one\'s self with a jerk or spasm,\n   often as in displeasure.'),
(29328, 'Flounce', 'n.', 'The act of floucing; a sudden, jerking motion of the body.'),
(29329, 'Flounce', 'n.', 'An ornamental appendage to the skirt of a woman\'s dress,\n   consisting of a strip gathered and sewed on by its upper edge around\n   the skirt, and left hanging.'),
(29330, 'Flounce', 'v. t.', 'To deck with a flounce or flounces; as, to flounce a\n   petticoat or a frock.'),
(29331, 'Flounder', 'n.', 'A flatfish of the family Pleuronectidae, of many species.'),
(29332, 'Flounder', 'n.', 'A tool used in crimping boot fronts.'),
(29333, 'Flounder', 'v. i.', 'To fling the limbs and body, as in making efforts to\n   move; to struggle, as a horse in the mire, or as a fish on land; to\n   roll, toss, and tumble; to flounce.'),
(29334, 'Flounder', 'n.', 'The act of floundering.'),
(29335, 'Flour', 'n.', 'The finely ground meal of wheat, or of any other grain;\n   especially, the finer part of meal separated by bolting; hence, the\n   fine and soft powder of any substance; as, flour of emery; flour of\n   mustard.'),
(29336, 'Floured', 'imp. & p. p.', 'of Flour'),
(29337, 'Flouring', 'p. pr. & vb. n.', 'of Flour'),
(29338, 'Flour', 'v. t.', 'To grind and bolt; to convert into flour; as, to flour\n   wheat.'),
(29339, 'Flour', 'v. t.', 'To sprinkle with flour.'),
(29340, 'Floured', 'p. a.', 'Finely granulated; -- said of quicksilver which has\n   been granulated by agitation during the amalgamation process.'),
(29341, 'Flourish', 'v. i.', 'To grow luxuriantly; to increase and enlarge, as a\n   healthy growing plant; a thrive.'),
(29342, 'Flourish', 'v. i.', 'To be prosperous; to increase in wealth, honor,\n   comfort, happiness, or whatever is desirable; to thrive; to be\n   prominent and influental; specifically, of authors, painters, etc., to\n   be in a state of activity or production.'),
(29343, 'Flourish', 'v. i.', 'To use florid language; to indulge in rhetorical\n   figures and lofty expressions; to be flowery.'),
(29344, 'Flourish', 'v. i.', 'To make bold and sweeping, fanciful, or wanton\n   movements, by way of ornament, parade, bravado, etc.; to play with\n   fantastic and irregular motion.'),
(29345, 'Flourish', 'v. i.', 'To make ornamental strokes with the pen; to write\n   graceful, decorative figures.'),
(29346, 'Flourish', 'v. i.', 'To execute an irregular or fanciful strain of music,\n   by way of ornament or prelude.'),
(29347, 'Flourish', 'v. i.', 'To boast; to vaunt; to brag.'),
(29348, 'Flourish', 'v. t.', 'To adorn with flowers orbeautiful figures, either\n   natural or artificial; to ornament with anything showy; to embellish.'),
(29349, 'Flourish', 'v. t.', 'To embellish with the flowers of diction; to adorn\n   with rhetorical figures; to grace with ostentatious eloquence; to set\n   off with a parade of words.'),
(29350, 'Flourish', 'v. t.', 'To move in bold or irregular figures; to swing about\n   in circles or vibrations by way of show or triumph; to brandish.'),
(29351, 'Flourish', 'v. t.', 'To develop; to make thrive; to expand.'),
(29352, 'Flourish', 'n.', 'A flourishing condition; prosperity; vigor.'),
(29353, 'Flourish', 'n.', 'Decoration; ornament; beauty.'),
(29354, 'Flourish', 'n.', 'Something made or performed in a fanciful, wanton, or\n   vaunting manner, by way of ostentation, to excite admiration, etc.;\n   ostentatious embellishment; ambitious copiousness or amplification;\n   parade of words and figures; show; as, a flourish of rhetoric or of\n   wit.'),
(29355, 'Flourish', 'n.', 'A fanciful stroke of the pen or graver; a merely\n   decorative figure.'),
(29356, 'Flourish', 'n.', 'A fantastic or decorative musical passage; a strain of\n   triumph or bravado, not forming part of a regular musical composition;\n   a cal; a fanfare.'),
(29357, 'Flourish', 'n.', 'The waving of a weapon or other thing; a brandishing; as,\n   the flourish of a sword.'),
(29358, 'Floury', 'a.', 'Of or resembling flour; mealy; covered with flour.'),
(29359, 'Flouted', 'imp. & p. p.', 'of Flout'),
(29360, 'Flouting', 'p. pr. & vb. n.', 'of Flout'),
(29361, 'Flout', 'v. t.', 'To mock or insult; to treat with contempt.'),
(29362, 'Flout', 'v. i.', 'To practice mocking; to behave with contempt; to sneer;\n   to fleer; -- often with at.'),
(29363, 'Flout', 'n.', 'A mock; an insult.'),
(29364, 'Flouter', 'n.', 'One who flouts; a mocker.'),
(29365, 'Flowed', 'imp. & p. p.', 'of Flow'),
(29366, 'Flowing', 'p. pr. & vb. n.', 'of Flow'),
(29367, 'Flowage', 'n.', 'An overflowing with water; also, the water which thus\n   overflows.'),
(29368, 'Flowen', '', 'imp. pl. of Fly, v. i.'),
(29369, 'Flower', 'n.', 'In the popular sense, the bloom or blossom of a plant; the\n   showy portion, usually of a different color, shape, and texture from\n   the foliage.'),
(29370, 'Flower', 'n.', 'That part of a plant destined to produce seed, and hence\n   including one or both of the sexual organs; an organ or combination of\n   the organs of reproduction, whether inclosed by a circle of foliar\n   parts or not. A complete flower consists of two essential parts, the\n   stamens and the pistil, and two floral envelopes, the corolla and\n   callyx. In mosses the flowers consist of a few special leaves\n   surrounding or subtending organs called archegonia. See Blossom, and\n   Corolla.'),
(29371, 'Flower', 'n.', 'The fairest, freshest, and choicest part of anything; as,\n   the flower of an army, or of a family; the state or time of freshness\n   and bloom; as, the flower of life, that is, youth.'),
(29372, 'Flower', 'n.', 'Grain pulverized; meal; flour.'),
(29373, 'Flower', 'n.', 'A substance in the form of a powder, especially when\n   condensed from sublimation; as, the flowers of sulphur.'),
(29374, 'Flower', 'n.', 'A figure of speech; an ornament of style.'),
(29375, 'Flower', 'n.', 'Ornamental type used chiefly for borders around pages,\n   cards, etc.'),
(29376, 'Flower', 'n.', 'Menstrual discharges.'),
(29377, 'Flowered', 'imp. & p. p.', 'of Flower'),
(29378, 'Flower', 'v. i.', 'To blossom; to bloom; to expand the petals, as a plant;\n   to produce flowers; as, this plant flowers in June.'),
(29379, 'Flower', 'v. i.', 'To come into the finest or fairest condition.'),
(29380, 'Flower', 'v. i.', 'To froth; to ferment gently, as new beer.'),
(29381, 'Flower', 'v. i.', 'To come off as flowers by sublimation.'),
(29382, 'Flower', 'v. t.', 'To embellish with flowers; to adorn with imitated\n   flowers; as, flowered silk.'),
(29383, 'Flowerer', 'n.', 'A plant which flowers or blossoms.'),
(29384, 'Floweret', 'n.', 'A small flower; a floret.'),
(29385, 'Flowery', 'a.', 'Full of flowers; abounding with blossoms.'),
(29386, 'Flowery', 'a.', 'Highly embellished with figurative language; florid; as, a\n   flowery style.'),
(29387, 'Flowing', 'a.', 'That flows or for flowing (in various sense of the verb);\n   gliding along smoothly; copious.'),
(29388, 'Flowing', '', 'a. & n. from Flow, v. i. & t.'),
(29389, 'Flowk', 'n.', 'See 1st Fluke.'),
(29390, 'Flown', '', 'p. p. of Fly; -- often used with the auxiliary verb to be; as,\n   the birds are flown.'),
(29391, 'Flown', 'a.', 'Flushed, inflated.'),
(29392, 'Floyte', 'n. & v.', 'A variant of Flute.'),
(29393, 'Fluate', 'n.', 'A fluoride.'),
(29394, 'Fluavil', 'n.', 'A hydrocarbon extracted from gutta-percha, as a yellow,\n   resinous substance; -- called also fluanil.'),
(29395, 'Flucan', 'n.', 'Soft clayey matter in the vein, or surrounding it.'),
(29396, 'Fluence', 'n.', 'Fluency.'),
(29397, 'Fluency', 'n.', 'The quality of being fluent; smoothness; readiness of\n   utterance; volubility.'),
(29398, 'Fluent', 'a.', 'Flowing or capable of flowing; liquid; glodding; easily\n   moving.'),
(29399, 'Fluent', 'a.', 'Ready in the use of words; voluble; copious; having words\n   at command; and uttering them with facility and smoothness; as, a\n   fluent speaker; hence, flowing; voluble; smooth; -- said of language;\n   as, fluent speech.'),
(29400, 'Fluent', 'n.', 'A current of water; a stream.'),
(29401, 'Fluent', 'n.', 'A variable quantity, considered as increasing or\n   diminishing; -- called, in the modern calculus, the function or\n   integral.'),
(29402, 'Fluently', 'adv.', 'In a fluent manner.'),
(29403, 'Fluework', 'n.', 'A general name for organ stops in which the sound is\n   caused by wind passing through a flue or fissure and striking an edge\n   above; -- in distinction from reedwork.'),
(29404, 'Fluey', 'a.', 'Downy; fluffy.'),
(29405, 'Fluff', 'n.', 'Nap or down; flue; soft, downy feathers.'),
(29406, 'Fluffy', 'superl.', 'Pertaining to, or resembling, fluff or nap; soft and\n   downy.'),
(29407, 'Flugel', 'n.', 'A grand piano or a harpsichord, both being wing-shaped.'),
(29408, 'Fluid', 'a.', 'Having particles which easily move and change their relative\n   position without a separation of the mass, and which easily yield to\n   pressure; capable of flowing; liquid or gaseous.'),
(29409, 'Fluid', 'n.', 'A fluid substance; a body whose particles move easily among\n   themselves.'),
(29410, 'Fluidal', 'a.', 'Pertaining to a fluid, or to its flowing motion.'),
(29411, 'Fluinity', 'n.', 'The quality of being fluid or capable of flowing; a\n   liquid, aeriform. or gaseous state; -- opposed to solidity.'),
(29412, 'Fluidize', 'v. t.', 'To render fluid.'),
(29413, 'Flukan', 'n.', 'Flucan.'),
(29414, 'Fluke', 'n.', 'The European flounder. See Flounder.'),
(29415, 'Fluke', 'n.', 'A parasitic trematode worm of several species, having a\n   flat, lanceolate body and two suckers. Two species (Fasciola hepatica\n   and Distoma lanceolatum) are found in the livers of sheep, and produce\n   the disease called rot.'),
(29416, 'Fluke', 'n.', 'The part of an anchor which fastens in the ground; a flook.\n   See Anchor.'),
(29417, 'Fluke', 'n.', 'One of the lobes of a whale\'s tail, so called from the\n   resemblance to the fluke of an anchor.'),
(29418, 'Fluke', 'n.', 'An instrument for cleaning out a hole drilled in stone for\n   blasting.'),
(29419, 'Fluke', 'n.', 'An accidental and favorable stroke at billiards (called a\n   scratch in the United States); hence, any accidental or unexpected\n   advantage; as, he won by a fluke.'),
(29420, 'Fluky', 'a.', 'Formed like, or having, a fluke.'),
