(29659, 'Folks', 'n. collect. & pl.', 'People in general, or a separate class of\n   people; -- generally used in the plural form, and often with a\n   qualifying adjective; as, the old folks; poor folks.'),
(29660, 'Folks', 'n. collect. & pl.', 'The persons of one\'s own family; as, our\n   folks are all well.'),
(29661, 'Folkland', 'n.', 'Land held in villenage, being distributed among the folk,\n   or people, at the pleasure of the lord of the manor, and resumed at his\n   discretion. Not being held by any assurance in writing, it was opposed\n   to bookland or charter land, which was held by deed.'),
(29662, 'Folklore', '', 'Alt. of Folk lore'),
(29663, 'Folkmote', 'n.', 'An assembly of the people'),
(29664, 'Folkmote', 'n.', 'a general assembly of the people to consider and order\n   matters of the commonwealth; also, a local court.'),
(29665, 'Follicle', 'n.', 'A simple podlike pericarp which contains several seeds\n   and opens along the inner or ventral suture, as in the peony, larkspur\n   and milkweed.'),
(29666, 'Follicle', 'n.', 'A small cavity, tubular depression, or sac; as, a hair\n   follicle.'),
(29667, 'Follicle', 'n.', 'A simple gland or glandular cavity; a crypt.'),
(29668, 'Follicle', 'n.', 'A small mass of adenoid tissue; as, a lymphatic follicle.'),
(29669, 'Folliful', 'a.', 'Full of folly.'),
(29670, 'Followed', 'imp. & p. p.', 'of Follow'),
(29671, 'Follow', 'v. t.', 'To go or come after; to move behind in the same path or\n   direction; hence, to go with (a leader, guide, etc.); to accompany; to\n   attend.'),
(29672, 'Follow', 'v. t.', 'To endeavor to overtake; to go in pursuit of; to chase;\n   to pursue; to prosecute.'),
(29673, 'Follow', 'v. t.', 'To accept as authority; to adopt the opinions of; to\n   obey; to yield to; to take as a rule of action; as, to follow good\n   advice.'),
(29674, 'Follow', 'v. t.', 'To copy after; to take as an example.'),
(29675, 'Follow', 'v. t.', 'To succeed in order of time, rank, or office.'),
(29676, 'Follow', 'v. t.', 'To result from, as an effect from a cause, or an\n   inference from a premise.'),
(29677, 'Follow', 'v. t.', 'To watch, as a receding object; to keep the eyes fixed\n   upon while in motion; to keep the mind upon while in progress, as a\n   speech, musical performance, etc.; also, to keep up with; to understand\n   the meaning, connection, or force of, as of a course of thought or\n   argument.'),
(29678, 'Follow', 'v. t.', 'To walk in, as a road or course; to attend upon closely,\n   as a profession or calling.'),
(29679, 'Follow', 'v. i.', 'To go or come after; -- used in the various senses of\n   the transitive verb: To pursue; to attend; to accompany; to be a\n   result; to imitate.'),
(29680, 'Follower', 'n.', 'One who follows; a pursuer; an attendant; a disciple; a\n   dependent associate; a retainer.'),
(29681, 'Follower', 'n.', 'A sweetheart; a beau.'),
(29682, 'Follower', 'n.', 'The removable flange, or cover, of a piston. See Illust.\n   of Piston.'),
(29683, 'Follower', 'n.', 'A gland. See Illust. of Stuffing box.'),
(29684, 'Follower', 'n.', 'The part of a machine that receives motion from another\n   part. See Driver.'),
(29685, 'Follower', 'n.', 'Among law stationers, a sheet of parchment or paper which\n   is added to the first sheet of an indenture or other deed.'),
(29686, 'Follies', 'pl. ', 'of Folly'),
(29687, 'Folly', 'n.', 'The state of being foolish; want of good sense; levity,\n   weakness, or derangement of mind.'),
(29688, 'Folly', 'n.', 'A foolish act; an inconsiderate or thoughtless procedure;\n   weak or light-minded conduct; foolery.'),
(29689, 'Folly', 'n.', 'Scandalous crime; sin; specifically, as applied to a woman,\n   wantonness.'),
(29690, 'Folly', 'n.', 'The result of a foolish action or enterprise.'),
(29691, 'Folwe', 'v. t.', 'To follow.'),
(29692, 'Fomented', 'imp. & p. p.', 'of Foment'),
(29693, 'Foment', 'v. t.', 'To apply a warm lotion to; to bathe with a cloth or\n   sponge wet with warm water or medicated liquid.'),
(29694, 'Foment', 'v. t.', 'To cherish with heat; to foster.'),
(29695, 'Foment', 'v. t.', 'To nurse to life or activity; to cherish and promote by\n   excitements; to encourage; to abet; to instigate; -- used often in a\n   bad sense; as, to foment ill humors.'),
(29696, 'Fomenter', 'n.', 'One who foments; one who encourages or instigates; as, a\n   fomenter of sedition.'),
(29697, 'Fomites', 'pl. ', 'of Fomes'),
(29698, 'Fomes', 'n.', 'Any substance supposed to be capable of absorbing,\n   retaining, and transporting contagious or infectious germs; as, woolen\n   clothes are said to be active fomites.'),
(29699, 'Fonde', 'v. t. & i.', 'To endeavor; to strive; to try.'),
(29700, 'Fondled', 'imp. & p. p.', 'of Fondle'),
(29701, 'Fondling', 'p. pr. & vb. n.', 'of Fondle'),
(29702, 'Fondle', 'v.', 'To treat or handle with tenderness or in a loving manner;\n   to caress; as, a nurse fondles a child.'),
(29703, 'Fondler', 'n.', 'One who fondles.'),
(29704, 'Fondling', 'n.', 'The act of caressing; manifestation of tenderness.'),
(29705, 'Fondling', 'n.', 'A person or thing fondled or caressed; one treated with\n   foolish or doting affection.'),
(29706, 'Fondling', 'n.', 'A fool; a simpleton; a ninny.'),
(29707, 'Fondly', 'adv.', 'Foolishly.'),
(29708, 'Fondly', 'adv.', 'In a fond manner; affectionately; tenderly.'),
(29709, 'Fondness', 'n.', 'The quality or state of being fond; foolishness.'),
(29710, 'Fondness', 'n.', 'Doting affection; tender liking; strong appetite,\n   propensity, or relish; as, he had a fondness for truffles.'),
(29711, 'Fondon', 'n.', 'A large copper vessel used for hot amalgamation.'),
(29712, 'Fondus', 'n.', 'A style of printing calico, paper hangings, etc., in which\n   the colors are in bands and graduated into each other.'),
(29713, 'Fonge', 'v. t.', 'To take; to receive.'),
(29714, 'Fonly', 'adv.', 'Foolishly; fondly.'),
(29715, 'Fonne', 'n.', 'A fon.'),
(29716, 'Fontal', 'a.', 'Pertaining to a font, fountain, source, or origin;\n   original; primitive.'),
(29717, 'Fontanel', 'n.', 'An issue or artificial ulcer for the discharge of humors\n   from the body.'),
(29718, 'Fontanel', 'n.', 'One of the membranous intervals between the incompleted\n   angles of the parietal and neighboring bones of a fetal or young skull;\n   -- so called because it exhibits a rhythmical pulsation.'),
(29719, 'Fontange', 'n.', 'A kind of tall headdress formerly worn.'),
(29720, 'Foodful', 'a.', 'Full of food; supplying food; fruitful; fertile.'),
(29721, 'Foodless', 'a.', 'Without food; barren.'),
(29722, 'Foody', 'a.', 'Eatable; fruitful.'),
(29723, 'Fooled', 'imp. & p. p.', 'of Fool'),
(29724, 'Fooling', 'p. pr. & vb. n.', 'of Fool'),
(29725, 'Foolahs', 'n. pl.', 'Same as Fulahs.'),
(29726, 'Foolery', 'n.', 'The practice of folly; the behavior of a fool; absurdity.'),
(29727, 'Foolery', 'n.', 'An act of folly or weakness; a foolish practice; something\n   absurd or nonsensical.'),
(29728, 'Foolfish', 'n.', 'The orange filefish. See Filefish.'),
(29729, 'Foolfish', 'n.', 'The winter flounder. See Flounder.'),
(29730, 'Foolify', 'v. t.', 'To make a fool of; to befool.'),
(29731, 'Foolish', 'a.', 'Marked with, or exhibiting, folly; void of understanding;\n   weak in intellect; without judgment or discretion; silly; unwise.'),
(29732, 'Foolish', 'a.', 'Such as a fool would do; proceeding from weakness of mind\n   or silliness; exhibiting a want of judgment or discretion; as, a\n   foolish act.'),
(29733, 'Foolish', 'a.', 'Absurd; ridiculous; despicable; contemptible.'),
(29734, 'Foolscap', 'n.', 'A writing paper made in sheets, ordinarily 16 x 13\n   inches, and folded so as to make a page 13 x 8 inches. See Paper.'),
(29735, 'Footed', 'imp. & p. p.', 'of Foot'),
(29736, 'Footing', 'p. pr. & vb. n.', 'of Foot'),
(29737, 'Football', 'n.', 'An inflated ball to be kicked in sport, usually made in\n   India rubber, or a bladder incased in Leather.'),
(29738, 'Football', 'n.', 'The game of kicking the football by opposing parties of\n   players between goals.'),
(29739, 'Footband', 'n.', 'A band of foot soldiers.'),
(29740, 'Footbath', 'n.', 'A bath for the feet; also, a vessel used in bathing the\n   feet.'),
(29741, 'Footboy', 'n.', 'A page; an attendant in livery; a lackey.'),
(29742, 'Footed', 'a.', 'Having a foot or feet; shaped in the foot.'),
(29743, 'Footed', 'a.', 'Having a foothold; established.'),
(29744, 'Footfall', 'n.', 'A setting down of the foot; a footstep; the sound of a\n   footstep.'),
(29745, 'Foothalt', 'n.', 'A disease affecting the feet of sheep.'),
(29746, 'Foothill', 'n.', 'A low hill at the foot of higher hills or mountains.'),
(29747, 'Foothold', 'n.', 'A holding with the feet; firm standing; that on which one\n   may tread or rest securely; footing.'),
(29748, 'Foothook', 'n.', 'See Futtock.'),
(29749, 'Foothot', 'adv.', 'Hastily; immediately; instantly; on the spot; hotfloot.'),
(29750, 'Footing', 'n.', 'Ground for the foot; place for the foot to rest on; firm\n   foundation to stand on.'),
(29751, 'Footing', 'n.', 'Standing; position; established place; basis for\n   operation; permanent settlement; foothold.'),
(29752, 'Footing', 'n.', 'Relative condition; state.'),
(29753, 'Footing', 'n.', 'Tread; step; especially, measured tread.'),
(29754, 'Footing', 'n.', 'The act of adding up a column of figures; the amount or\n   sum total of such a column.'),
(29755, 'Footing', 'n.', 'The act of putting a foot to anything; also, that which is\n   added as a foot; as, the footing of a stocking.'),
(29756, 'Footing', 'n.', 'A narrow cotton lace, without figures.'),
(29757, 'Footing', 'n.', 'The finer refuse part of whale blubber, not wholly\n   deprived of oil.'),
(29758, 'Footing', 'n.', 'The thickened or sloping portion of a wall, or of an\n   embankment at its foot.'),
(29759, 'Footless', 'a.', 'Having no feet.'),
(29760, 'Footmen', 'pl. ', 'of Footman'),
(29761, 'Footman', 'n.', 'A soldier who marches and fights on foot; a foot soldier.'),
(29762, 'Footman', 'n.', 'A man in waiting; a male servant whose duties are to\n   attend the door, the carriage, the table, etc.'),
(29763, 'Footman', 'n.', 'Formerly, a servant who ran in front of his master\'s\n   carriage; a runner.'),
(29764, 'Footman', 'n.', 'A metallic stand with four feet, for keeping anything warm\n   before a fire.'),
(29765, 'Footman', 'n.', 'A moth of the family Lithosidae; -- so called from its\n   livery-like colors.'),
(29766, 'Footmark', 'n.', 'A footprint; a track or vestige.'),
(29767, 'Footnote', 'n.', 'A note of reference or comment at the foot of a page.'),
(29768, 'Footpace', 'n.', 'A walking pace or step.'),
(29769, 'Footpace', 'n.', 'A dais, or elevated platform; the highest step of the\n   altar; a landing in a staircase.'),
(29770, 'Footpad', 'n.', 'A highwayman or robber on foot.'),
(29771, 'Footpath', 'n.', 'A narrow path or way for pedestrains only; a footway.'),
(29772, 'Footrope', 'n.', 'The rope rigged below a yard, upon which men stand when\n   reefing or furling; -- formerly called a horse.'),
(29773, 'Footrope', 'n.', 'That part of the boltrope to which the lower edge of a\n   sail is sewed.'),
(29774, 'Foots', 'n. pl.', 'The settlings of oil, molasses, etc., at the bottom of a\n   barrel or hogshead.'),
(29775, 'Footstep', 'n.', 'The mark or impression of the foot; a track; hence,\n   visible sign of a course pursued; token; mark; as, the footsteps of\n   divine wisdom.'),
(29776, 'Footstep', 'n.', 'An inclined plane under a hand printing press.'),
(29777, 'Footway', 'n.', 'A passage for pedestrians only.'),
(29778, 'Footworn', 'a.', 'Worn by, or weared in, the feet; as, a footworn path; a\n   footworn traveler.'),
(29779, 'Footy', 'a.', 'Having foots, or settlings; as, footy oil, molasses, etc.'),
(29780, 'Footy', 'a.', 'Poor; mean.'),
(29781, 'Fopling', 'n.', 'A petty fop.'),
(29782, 'Foppery', 'n.', 'The behavior, dress, or other indication of a fop;\n   coxcombry; affectation of show; showy folly.'),
(29783, 'Foppery', 'n.', 'Folly; foolery.'),
(29784, 'Foppish', 'a.', 'Foplike; characteristic of a top in dress or manners;\n   making an ostentatious display of gay clothing; affected in manners.'),
(29785, 'Forage', 'n.', 'The act of foraging; search for provisions, etc.'),
(29786, 'Forage', 'n.', 'Food of any kind for animals, especially for horses and\n   cattle, as grass, pasture, hay, corn, oats.'),
(29787, 'Foraged', 'imp. & p. p.', 'of Forage'),
(29788, 'Foraging', 'p. pr. & vb. n.', 'of Forage'),
(29789, 'Forage', 'v. i.', 'To wander or rove in search of food; to collect food,\n   esp. forage, for horses and cattle by feeding on or stripping the\n   country; to ravage; to feed on spoil.'),
(29790, 'Forage', 'v. t.', 'To strip of provisions; to supply with forage; as, to\n   forage steeds.'),
(29791, 'Forager', 'n.', 'One who forages.'),
(29792, 'Foralite', 'n.', 'A tubelike marking, occuring in sandstone and other\n   strata.'),
(29793, 'Foramina', 'pl. ', 'of Foramen'),
(29794, 'Foramen', 'n.', 'A small opening, perforation, or orifice; a fenestra.'),
(29795, 'Foray', 'n.', 'A sudden or irregular incursion in border warfare; hence,\n   any irregular incursion for war or spoils; a raid.'),
(29796, 'Foray', 'v. t.', 'To pillage; to ravage.'),
(29797, 'Forayer', 'n.', 'One who makes or joins in a foray.'),
(29798, 'Forbade', '', 'imp. of Forbid.'),
(29799, 'Forbathe', 'v. t.', 'To bathe.'),
(29800, 'Forbear', 'n.', 'An ancestor; a forefather; -- usually in the plural.'),
(29801, 'Forbore', 'imp.', 'of Forbear'),
(29802, 'Forbare', '', 'of Forbear'),
(29803, 'Forborne', 'p. p.', 'of Forbear'),
(29804, 'Forbear', 'v. i.', 'To refrain from proceeding; to pause; to delay.'),
(29805, 'Forbear', 'v. i.', 'To refuse; to decline; to give no heed.'),
(29806, 'Forbear', 'v. i.', 'To control one\'s self when provoked.'),
(29807, 'Forbear', 'v. t.', 'To keep away from; to avoid; to abstain from; to give\n   up; as, to forbear the use of a word of doubdtful propriety.'),
(29808, 'Forbear', 'v. t.', 'To treat with consideration or indulgence.'),
(29809, 'Forbear', 'v. t.', 'To cease from bearing.'),
(29810, 'Forbade', 'imp.', 'of Forbid'),
(29811, 'Forbid', '', 'of Forbid'),
(29812, 'Forbid', 'v. t.', 'To command against, or contrary to; to prohibit; to\n   interdict.'),
(29813, 'Forbid', 'v. t.', 'To deny, exclude from, or warn off, by express command;\n   to command not to enter.'),
(29814, 'Forbid', 'v. t.', 'To oppose, hinder, or prevent, as if by an effectual\n   command; as, an impassable river forbids the approach of the army.'),
(29815, 'Forbid', 'v. t.', 'To accurse; to blast.'),
(29816, 'Forbid', 'v. t.', 'To defy; to challenge.'),
(29817, 'Forbid', 'v. i.', 'To utter a prohibition; to prevent; to hinder.'),
(29818, 'Forblack', 'a.', 'Very black.'),
(29819, 'Forboden', '', 'p. p. of Forbid.'),
(29820, 'Forbore', '', 'imp. of Forbear.'),
(29821, 'Forborne', '', 'p. p. of Forbear.'),
(29822, 'Forby', 'adv. & prep.', 'Near; hard by; along; past.'),
(29823, 'Forcarve', 'v. t.', 'To cut completely; to cut off.'),
(29824, 'Force', 'v. t.', 'To stuff; to lard; to farce.'),
(29825, 'Force', 'n.', 'A waterfall; a cascade.'),
(29826, 'Force', 'n.', 'Strength or energy of body or mind; active power; vigor;\n   might; often, an unusual degree of strength or energy; capacity of\n   exercising an influence or producing an effect; especially, power to\n   persuade, or convince, or impose obligation; pertinency; validity;\n   special signification; as, the force of an appeal, an argument, a\n   contract, or a term.'),
(29827, 'Force', 'n.', 'Power exerted against will or consent; compulsory power;\n   violence; coercion.'),
(29828, 'Force', 'n.', 'Strength or power for war; hence, a body of land or naval\n   combatants, with their appurtenances, ready for action; -- an armament;\n   troops; warlike array; -- often in the plural; hence, a body of men\n   prepared for action in other ways; as, the laboring force of a\n   plantation.'),
(29829, 'Force', 'n.', 'Strength or power exercised without law, or contrary to law,\n   upon persons or things; violence.'),
(29830, 'Force', 'n.', 'Validity; efficacy.'),
(29831, 'Force', 'n.', 'Any action between two bodies which changes, or tends to\n   change, their relative condition as to rest or motion; or, more\n   generally, which changes, or tends to change, any physical relation\n   between them, whether mechanical, thermal, chemical, electrical,\n   magnetic, or of any other kind; as, the force of gravity; cohesive\n   force; centrifugal force.'),
(29832, 'Forced', 'imp. & p. p.', 'of Force'),
(29833, 'Forcing', 'p. pr. & vb. n.', 'of Force'),
(29834, 'Force', 'n.', 'To constrain to do or to forbear, by the exertion of a power\n   not resistible; to compel by physical, moral, or intellectual means; to\n   coerce; as, masters force slaves to labor.'),
(29835, 'Force', 'n.', 'To compel, as by strength of evidence; as, to force\n   conviction on the mind.'),
(29836, 'Force', 'n.', 'To do violence to; to overpower, or to compel by violence to\n   one;s will; especially, to ravish; to violate; to commit rape upon.'),
(29837, 'Force', 'n.', 'To obtain or win by strength; to take by violence or\n   struggle; specifically, to capture by assault; to storm, as a fortress.'),
(29838, 'Force', 'n.', 'To impel, drive, wrest, extort, get, etc., by main strength\n   or violence; -- with a following adverb, as along, away, from, into,\n   through, out, etc.'),
(29839, 'Force', 'n.', 'To put in force; to cause to be executed; to make binding;\n   to enforce.'),
(29840, 'Force', 'n.', 'To exert to the utmost; to urge; hence, to strain; to urge\n   to excessive, unnatural, or untimely action; to produce by unnatural\n   effort; as, to force a consient or metaphor; to force a laugh; to force\n   fruits.'),
(29841, 'Force', 'n.', 'To compel (an adversary or partner) to trump a trick by\n   leading a suit of which he has none.'),
(29842, 'Force', 'n.', 'To provide with forces; to reenforce; to strengthen by\n   soldiers; to man; to garrison.'),
(29843, 'Force', 'n.', 'To allow the force of; to value; to care for.'),
(29844, 'Force', 'v. i.', 'To use violence; to make violent effort; to strive; to\n   endeavor.'),
(29845, 'Force', 'v. i.', 'To make a difficult matter of anything; to labor; to\n   hesitate; hence, to force of, to make much account of; to regard.'),
(29846, 'Force', 'v. i.', 'To be of force, importance, or weight; to matter.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(29847, 'Forced', 'a.', 'Done or produced with force or great labor, or by\n   extraordinary exertion; hurried; strained; produced by unnatural effort\n   or pressure; as, a forced style; a forced laugh.'),
(29848, 'Forceful', 'a.', 'Full of or processing force; exerting force; mighty.'),
(29849, 'Forceps', 'n.', 'A pair of pinchers, or tongs; an instrument for grasping,\n   holding firmly, or exerting traction upon, bodies which it would be\n   inconvenient or impracticable to seize with the fingers, especially one\n   for delicate operations, as those of watchmakers, surgeons,\n   accoucheurs, dentists, etc.'),
(29850, 'Forceps', 'n.', 'The caudal forceps-shaped appendage of earwigs and some\n   other insects. See Earwig.'),
(29851, 'Forcer', 'n.', 'One who, or that which, forces or drives.'),
(29852, 'Forcer', 'n.', 'The solid piston of a force pump; the instrument by which\n   water is forced in a pump.'),
(29853, 'Forcer', 'n.', 'A small hand pump for sinking pits, draining cellars, etc.'),
(29854, 'Forcible', 'a.', 'Possessing force; characterized by force, efficiency, or\n   energy; powerful; efficacious; impressive; influential.'),
(29855, 'Forcible', 'a.', 'Violent; impetuous.'),
(29856, 'Forcible', 'a.', 'Using force against opposition or resistance; obtained by\n   compulsion; effected by force; as, forcible entry or abduction.'),
(29857, 'Forcibly', 'adv.', 'In a forcible manner.'),
(29858, 'Forcing', 'n.', 'The accomplishing of any purpose violently, precipitately,\n   prematurely, or with unusual expedition.'),
(29859, 'Forcing', 'n.', 'The art of raising plants, flowers, and fruits at an\n   earlier season than the natural one, as in a hitbed or by the use of\n   artificial heat.'),
(29860, 'Forcipal', 'a.', 'Forked or branched like a pair of forceps; constructed so\n   as to open and shut like a pair of forceps.'),
(29861, 'Forcut', 'v. t.', 'To cut completely; to cut off.'),
(29862, 'Forded', 'imp. & p. p.', 'of Ford'),
(29863, 'Fording', 'p. pr. & vb. n.', 'of Ford'),
(29864, 'Fordable', 'a.', 'Capable of being forded.'),
(29865, 'Fordless', 'a.', 'Without a ford.'),
(29866, 'Fordo', 'v. i.', 'To destroy; to undo; to ruin.'),
(29867, 'Fordo', 'v. i.', 'To overcome with fatigue; to exhaust.'),
(29868, 'Fordone', 'a.', 'Undone; ruined.'),
(29869, 'Fordrive', 'v. t.', 'To drive about; to drive here and there.'),
(29870, 'Fordry', 'a.', 'Entirely dry; withered.'),
(29871, 'Fordwine', 'v. i.', 'To dwindle away; to disappear.'),
(29872, 'Forearm', 'v. t.', 'To arm or prepare for attack or resistance before the\n   time of need.'),
(29873, 'Forearm', 'n.', 'That part of the arm or fore limb between the elbow and\n   wrist; the antibrachium.'),
(29874, 'Forebeam', 'n.', 'The breast beam of a loom.'),
(29875, 'Forebear', 'n.', 'An ancestor. See Forbear.'),
(29876, 'Forebode', 'v. t.', 'To foretell.'),
(29877, 'Forebode', 'v. t.', 'To be prescient of (some ill or misfortune); to have\n   an inward conviction of, as of a calamity which is about to happen; to\n   augur despondingly.'),
(29878, 'Forebode', 'v. i.', 'To fortell; to presage; to augur.'),
(29879, 'Forebode', 'n.', 'Prognostication; presage.'),
(29880, 'Foreby', 'prep.', 'Near; hard by; along; past. See Forby.'),
(29881, 'Forecast', 'v. t.', 'To plan beforehand; to scheme; to project.'),
(29882, 'Forecast', 'v. t.', 'To foresee; to calculate beforehand, so as to provide\n   for.'),
(29883, 'Forecast', 'v. i.', 'To contrive or plan beforehand.'),
(29884, 'Forecast', 'n.', 'Previous contrivance or determination; predetermination.'),
(29885, 'Forecast', 'n.', 'Foresight of consequences, and provision against them;\n   prevision; premeditation.'),
(29886, 'Foredate', 'v. t.', 'To date before the true time; to antendate.'),
(29887, 'Foredeck', 'n.', 'The fore part of a deck, or of a ship.'),
(29888, 'Foredeem', 'v. t.', 'To recognize or judge in advance; to forebode.'),
(29889, 'Foredeem', 'v. i.', 'To know or discover beforehand; to foretell.'),
(29890, 'Foredoom', 'v. t.', 'To doom beforehand; to predestinate.'),
(29891, 'Foredoom', 'n.', 'Doom or sentence decreed in advance.'),
(29892, 'Forefeel', 'v. t.', 'To feel beforehand; to have a presentiment of.'),
(29893, 'Forefend', 'v. t.', 'To hinder; to fend off; to avert; to prevent the\n   approach of; to forbid or prohibit. See Forfend.'),
(29894, 'Foreflow', 'v. t.', 'To flow before.'),
(29895, 'Forefoot', 'n.', 'One of the anterior feet of a quardruped or multiped; --\n   usually written fore foot.'),
(29896, 'Forefoot', 'n.', 'A piece of timber which terminates the keel at the fore\n   end, connecting it with the lower end of the stem.'),
(29897, 'Foregame', 'n.', 'A first game; first plan.'),
(29898, 'Foregift', 'n.', 'A premium paid by / lessee when taking his lease.'),
