(30401, 'Fraise', 'n.', 'A fluted reamer for enlarging holes in stone; a small\n   milling cutter.'),
(30402, 'Fraise', 'v. t.', 'To protect, as a line of troops, against an onset of\n   cavalry, by opposing bayonets raised obliquely forward.'),
(30403, 'Fraised', 'a.', 'Fortified with a fraise.'),
(30404, 'Fraken', 'n.', 'A freckle.'),
(30405, 'Framable', 'a.', 'Capable of being framed.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(30406, 'Framed', 'imp. & p. p.', 'of Frame'),
(30407, 'Framing', 'p. pr. & vb. n.', 'of Frame'),
(30408, 'Frame', 'v. t.', 'To construct by fitting and uniting the several parts of\n   the skeleton of any structure; specifically, in woodwork, to put\n   together by cutting parts of one member to fit parts of another. See\n   Dovetail, Halve, v. t., Miter, Tenon, Tooth, Tusk, Scarf, and Splice.'),
(30409, 'Frame', 'v. t.', 'To originate; to plan; to devise; to contrive; to\n   compose; in a bad sense, to invent or fabricate, as something false.'),
(30410, 'Frame', 'v. t.', 'To fit to something else, or for some specific end; to\n   adjust; to regulate; to shape; to conform.'),
(30411, 'Frame', 'v. t.', 'To cause; to bring about; to produce.'),
(30412, 'Frame', 'v. t.', 'To support.'),
(30413, 'Frame', 'v. t.', 'To provide with a frame, as a picture.'),
(30414, 'Frame', 'v. i.', 'To shape; to arrange, as the organs of speech.'),
(30415, 'Frame', 'v. i.', 'To proceed; to go.'),
(30416, 'Frame', 'n.', 'Anything composed of parts fitted and united together; a\n   fabric; a structure; esp., the constructional system, whether of timber\n   or metal, that gives to a building, vessel, etc., its model and\n   strength; the skeleton of a structure.'),
(30417, 'Frame', 'n.', 'The bodily structure; physical constitution; make or build\n   of a person.'),
(30418, 'Frame', 'n.', 'A kind of open case or structure made for admitting,\n   inclosing, or supporting things, as that which incloses or contains a\n   window, door, picture, etc.; that on which anything is held or\n   stretched'),
(30419, 'Frame', 'n.', 'The skeleton structure which supports the boiler and\n   machinery of a locomotive upon its wheels.'),
(30420, 'Frame', 'n.', 'A molding box or flask, which being filled with sand serves\n   as a mold for castings.'),
(30421, 'Frame', 'n.', 'The ribs and stretchers of an umbrella or other structure\n   with a fabric covering.'),
(30422, 'Frame', 'n.', 'A structure of four bars, adjustable in size, on which\n   cloth, etc., is stretched for quilting, embroidery, etc.'),
(30423, 'Frame', 'n.', 'A glazed portable structure for protecting young plants from\n   frost.'),
(30424, 'Frame', 'n.', 'A stand to support the type cases for use by the compositor.'),
(30425, 'Frame', 'n.', 'A term applied, especially in England, to certain machines\n   built upon or within framework; as, a stocking frame; lace frame;\n   spinning frame, etc.'),
(30426, 'Frame', 'n.', 'Form; shape; proportion; scheme; structure; constitution;\n   system; as, a frameof government.'),
(30427, 'Frame', 'n.', 'Particular state or disposition, as of the mind; humor;\n   temper; mood; as, to be always in a happy frame.'),
(30428, 'Frame', 'n.', 'Contrivance; the act of devising or scheming.'),
(30429, 'Framer', 'n.', 'One who frames; as, the framer of a building; the framers\n   of the Constitution.'),
(30430, 'Framing', 'n.', 'The act, process, or style of putting together a frame, or\n   of constructing anything; a frame; that which frames.'),
(30431, 'Framing', 'n.', 'A framework, or a sy/ of frames.'),
(30432, 'Frampel', 'a.', 'Alt. of Frampoid'),
(30433, 'Frampoid', 'a.', 'Peevish; cross; vexatious; quarrelsome.'),
(30434, 'Franc', 'a.', 'A silver coin of France, and since 1795 the unit of the\n   French monetary system. It has been adopted by Belgium and Swizerland.\n   It is equivalent to about nineteen cents, or ten pence, and is divided\n   into 100 centimes.'),
(30435, 'Francic', 'a.', 'Pertaining to the Franks, or their language; Frankish.'),
(30436, 'Frangent', 'a.', 'Causing fracture; breaking.'),
(30437, 'Franion', 'n.', 'A paramour; a loose woman; also, a gay, idle fellow.'),
(30438, 'Frank', 'n.', 'A pigsty.'),
(30439, 'Frank', 'v. t.', 'To shut up in a frank or sty; to pen up; hence, to cram;\n   to fatten.'),
(30440, 'Frank', 'n.', 'The common heron; -- so called from its note.'),
(30441, 'Frank', 'n.', 'Unbounded by restrictions, limitations, etc.; free.'),
(30442, 'Frank', 'n.', 'Free in uttering one\'s real sentiments; not reserved; using\n   no disguise; candid; ingenuous; as, a frank nature, conversation,\n   manner, etc.'),
(30443, 'Frank', 'n.', 'Liberal; generous; profuse.'),
(30444, 'Frank', 'n.', 'Unrestrained; loose; licentious; -- used in a bad sense.'),
(30445, 'Franked', 'imp. & p. p.', 'of Frank'),
(30446, 'Franking', 'p. pr. & vb. n.', 'of Frank'),
(30447, 'Frank', 'v. t.', 'To send by public conveyance free of expense.'),
(30448, 'Frank', 'v. t.', 'To extempt from charge for postage, as a letter, package,\n   or packet, etc.'),
(30449, 'Frank', 'a.', 'The privilege of sending letters or other mail matter, free\n   of postage, or without charge; also, the sign, mark, or signature\n   denoting that a letter or other mail matter is to free of postage.'),
(30450, 'Frank', 'a.', 'A member of one of the German tribes that in the fifth\n   century overran and conquered Gaul, and established the kingdom of\n   France.'),
(30451, 'Frank', 'a.', 'A native or inhabitant of Western Europe; a European; -- a\n   term used in the Levant.'),
(30452, 'Frank', 'a.', 'A French coin. See Franc.'),
(30453, 'Franking', 'n.', 'A method of forming a joint at the intersection of\n   window-sash bars, by cutting away only enough wood to show a miter.'),
(30454, 'Frankish', 'a.', 'Like, or pertaining to, the Franks.'),
(30455, 'Franklin', 'a.', 'An English freeholder, or substantial householder.'),
(30456, 'Frankly', 'adv.', 'In a frank manner; freely.'),
(30457, 'Frantic', 'a.', 'Mad; raving; furious; violent; wild and disorderly;\n   distracted.'),
(30458, 'Frapped', 'imp. & p. p.', 'of Frap'),
(30459, 'Frapping', 'p. pr. & vb. n.', 'of Frap'),
(30460, 'Frape', 'n.', 'A crowd, a rabble.'),
(30461, 'Frapler', 'n.', 'A blusterer; a rowdy.'),
(30462, 'Frater', 'n.', 'A monk; also, a frater house.'),
(30463, 'Fratery', 'n.', 'A frater house. See under Frater.'),
(30464, 'Fratrage', 'n.', 'A sharing among brothers, or brothers\' kin.'),
(30465, 'Fraud', 'n.', 'Deception deliberately practiced with a view to gaining an\n   unlawful or unfair advantage; artifice by which the right or interest\n   of another is injured; injurious stratagem; deceit; trick.'),
(30466, 'Fraud', 'n.', 'An intentional perversion of truth for the purpose of\n   obtaining some valuable thing or promise from another.'),
(30467, 'Fraud', 'n.', 'A trap or snare.'),
(30468, 'Fraudful', 'a.', 'Full of fraud, deceit, or treachery; trickish;\n   treacherous; fraudulent; -- applied to persons or things.'),
(30469, 'Fraught', 'n.', 'A freight; a cargo.'),
(30470, 'Fraught', 'a.', 'Freighted; laden; filled; stored; charged.'),
(30471, 'Fraught', '', 'of Fraught'),
(30472, 'Fraught', 'n.', 'To freight; to load; to burden; to fill; to crowd.'),
(30473, 'Fraxin', 'n.', 'A colorless crystalline substance, regarded as a glucoside,\n   and found in the bark of the ash (Fraxinus) and along with esculin in\n   the bark of the horse-chestnut. It shows a delicate fluorescence in\n   alkaline solutions; -- called also paviin.'),
(30474, 'Fraxinus', 'n.', 'A genus of deciduous forest trees, found in the north\n   temperate zone, and including the true ash trees.'),
(30475, 'Frayed', 'imp. & p. p.', 'of Fray'),
(30476, 'Fraying', 'p. pr. & vb. n.', 'of Fray'),
(30477, 'Fraying', 'n.', 'The skin which a deer frays from his horns.'),
(30478, 'Freaked', 'imp. & p. p.', 'of Freak'),
(30479, 'Freaking', 'p. pr. & vb. n.', 'of Freak'),
(30480, 'Freak', 'v. t.', 'To variegate; to checker; to streak.'),
(30481, 'Freak', 'n.', 'A sudden causeless change or turn of the mind; a whim of\n   fancy; a capricious prank; a vagary or caprice.'),
(30482, 'Freaking', 'a.', 'Freakish.'),
(30483, 'Freakish', 'a.', 'Apt to change the mind suddenly; whimsical; capricious.'),
(30484, 'Freck', 'v. t.', 'To checker; to diversify.'),
(30485, 'Freckle', 'v. t.', 'A small yellowish or brownish spot in the skin,\n   particularly on the face, neck, or hands.'),
(30486, 'Freckle', 'v. t.', 'Any small spot or discoloration.'),
(30487, 'Freckled', 'imp. & p. p.', 'of Freckle'),
(30488, 'Freckle', 'v. t.', 'To spinkle or mark with freckle or small discolored\n   spots; to spot.'),
(30489, 'Freckle', 'v. i.', 'To become covered or marked with freckles; to be\n   spotted.'),
(30490, 'Freckled', 'a.', 'Marked with freckles; spotted.'),
(30491, 'Freckly', 'a.', 'Full of or marked with freckles; sprinkled with spots;\n   freckled.'),
(30492, 'Freed', 'imp. & p. p.', 'of Free'),
(30493, 'Freeing', 'p. pr. & vb. n.', 'of Free'),
(30494, 'Freeborn', 'a.', 'Born free; not born in vassalage; inheriting freedom.'),
(30495, 'Freedmen', 'pl. ', 'of Freedman'),
(30496, 'Freedman', 'n.', 'A man who has been a slave, and has been set free.'),
(30497, 'Freedom', 'n.', 'The state of being free; exemption from the power and\n   control of another; liberty; independence.'),
(30498, 'Freedom', 'n.', 'Privileges; franchises; immunities.'),
(30499, 'Freedom', 'n.', 'Exemption from necessity, in choise and action; as, the\n   freedom of the will.'),
(30500, 'Freedom', 'n.', 'Ease; facility; as, he speaks or acts with freedom.'),
(30501, 'Freedom', 'n.', 'Frankness; openness; unreservedness.'),
(30502, 'Freedom', 'n.', 'Improper familiarity; violation of the rules of decorum;\n   license.'),
(30503, 'Freedom', 'n.', 'Generosity; liberality.'),
(30504, 'Freehold', 'n.', 'An estate in real property, of inheritance (in fee simple\n   or fee tail) or for life; or the tenure by which such estate is held.'),
(30505, 'Freelte', 'n.', 'Frailty.'),
(30506, 'Freely', 'adv.', 'In a free manner; without restraint or compulsion;\n   abundantly; gratuitously.'),
(30507, 'Freemen', 'pl. ', 'of Freeman'),
(30508, 'Freeman', 'n.', 'One who enjoys liberty, or who is not subject to the will\n   of another; one not a slave or vassal.'),
(30509, 'Freeman', 'n.', 'A member of a corporation, company, or city, possessing\n   certain privileges; a member of a borough, town, or State, who has the\n   right to vote at elections. See Liveryman.'),
(30510, 'Freeness', 'n.', 'The state or quality of being free; freedom; liberty;\n   openness; liberality; gratuitousness.'),
(30511, 'Freer', 'n.', 'One who frees, or sets free.'),
(30512, 'Freewill', 'a.', 'Of or pertaining to free will; voluntary; spontaneous;\n   as, a freewill offering.'),
(30513, 'Freeze', 'n.', 'A frieze.'),
(30514, 'Froze', 'imp.', 'of Freeze'),
(30515, 'Frozen', 'p. p.', 'of Freeze'),
(30516, 'Freezing', 'p. pr. & vb. n.', 'of Freeze'),
(30517, 'Freeze', 'v. i.', 'To become congealed by cold; to be changed from a liquid\n   to a solid state by the abstraction of heat; to be hardened into ice or\n   a like solid body.'),
(30518, 'Freeze', 'v. i.', 'To become chilled with cold, or as with cold; to suffer\n   loss of animation or life by lack of heat; as, the blood freezes in the\n   veins.'),
(30519, 'Freeze', 'v. t.', 'To congeal; to harden into ice; to convert from a fluid\n   to a solid form by cold, or abstraction of heat.'),
(30520, 'Freeze', 'v. t.', 'To cause loss of animation or life in, from lack of\n   heat; to give the sensation of cold to; to chill.'),
(30521, 'Freeze', 'n.', 'The act of congealing, or the state of being congealed.'),
(30522, 'Freezer', 'n.', 'One who, or that which, cools or freezes, as a\n   refrigerator, or the tub and can used in the process of freezing ice\n   cream.'),
(30523, 'Freezing', 'a.', 'Tending to freeze; for freezing; hence, cold or distant\n   in manner.'),
(30524, 'Freight', 'n.', 'That with which anything in fraught or laden for\n   transportation; lading; cargo, especially of a ship, or a car on a\n   railroad, etc.; as, a freight of cotton; a full freight.'),
(30525, 'Freight', 'n.', 'The sum paid by a party hiring a ship or part of a ship\n   for the use of what is thus hired.'),
(30526, 'Freight', 'n.', 'The price paid a common carrier for the carriage of goods.'),
(30527, 'Freight', 'n.', 'Freight transportation, or freight line.'),
(30528, 'Freight', 'a.', 'Employed in the transportation of freight; having to do\n   with freight; as, a freight car.'),
(30529, 'Freight', 'v. t.', 'To load with goods, as a ship, or vehicle of any kind,\n   for transporting them from one place to another; to furnish with\n   freight; as, to freight a ship; to freight a car.'),
(30530, 'Frelte', 'n.', 'Frailty.'),
(30531, 'Fremd', 'a.', 'Alt. of Fremed'),
(30532, 'Fremed', 'a.', 'Strange; foreign.'),
(30533, 'French', 'a.', 'Of or pertaining to France or its inhabitants.'),
(30534, 'French', 'n.', 'The language spoken in France.'),
(30535, 'French', 'n.', 'Collectively, the people of France.'),
(30536, 'Frenetir', 'a.', 'Distracted; mad; frantic; phrenetic.'),
(30537, 'Frenums', 'pl. ', 'of Frenum'),
(30538, 'Frena', 'pl. ', 'of Frenum'),
(30539, 'Frenum', 'n.', 'A cheek stripe of color.'),
(30540, 'Frenum', 'n.', 'Same as Fraenum.'),
(30541, 'Frenzied', 'p. p. & a.', 'Affected with frenzy; frantic; maddened.'),
(30542, 'Frenzies', 'pl. ', 'of Frenzy'),
(30543, 'Frenzy', 'n.', 'Any violent agitation of the mind approaching to\n   distraction; violent and temporary derangement of the mental faculties;\n   madness; rage.'),
(30544, 'Frenzy', 'a.', 'Mad; frantic.'),
(30545, 'Frenzy', 'v. t.', 'To affect with frenzy; to drive to madness'),
(30546, 'Frequent', 'n.', 'Often to be met with; happening at short intervals; often\n   repeated or occurring; as, frequent visits.'),
(30547, 'Frequent', 'n.', 'Addicted to any course of conduct; inclined to indulge in\n   any practice; habitual; persistent.'),
(30548, 'Frequent', 'n.', 'Full; crowded; thronged.'),
(30549, 'Frequent', 'n.', 'Often or commonly reported.'),
(30550, 'Frequent', 'a.', 'To visit often; to resort to often or habitually.'),
(30551, 'Frequent', 'a.', 'To make full; to fill.'),
(30552, 'Frere', 'n.', 'A friar.'),
(30553, 'Frescade', 'a.', 'A cool walk; shady place.'),
(30554, 'Frescoes', 'pl. ', 'of Fresco'),
(30555, 'Frescos', 'pl. ', 'of Fresco'),
(30556, 'Fresco', 'a.', 'A cool, refreshing state of the air; duskiness; coolness;\n   shade.'),
(30557, 'Fresco', 'a.', 'The art of painting on freshly spread plaster, before it\n   dries.'),
(30558, 'Fresco', 'a.', 'In modern parlance, incorrectly applied to painting on\n   plaster in any manner.'),
(30559, 'Fresco', 'a.', 'A painting on plaster in either of senses a and b.'),
(30560, 'Frescoed', 'imp. & p. p.', 'of Fresco'),
(30561, 'Fresco', 'v. t.', 'To paint in fresco, as walls.'),
(30562, 'Fresh', 'superl', 'Possessed of original life and vigor; new and strong;\n   unimpaired; sound.'),
(30563, 'Fresh', 'superl', 'New; original; additional.'),
(30564, 'Fresh', 'superl', 'Lately produced, gathered, or prepared for market; not\n   stale; not dried or preserved; not wilted, faded, or tainted; in good\n   condition; as, fresh vegetables, flowers, eggs, meat, fruit, etc.;\n   recently made or obtained; occurring again; repeated; as, a fresh\n   supply of goods; fresh tea, raisins, etc.; lately come or made public;\n   as, fresh news; recently taken from a well or spring; as, fresh water.'),
(30565, 'Fresh', 'superl', 'Youthful; florid; as, these fresh nymphs.'),
(30566, 'Fresh', 'superl', 'In a raw, green, or untried state; uncultivated;\n   uncultured; unpracticed; as, a fresh hand on a ship.'),
(30567, 'Fresh', 'superl', 'Renewed in vigor, alacrity, or readiness for action; as,\n   fresh for a combat; hence, tending to renew in vigor; rather strong;\n   cool or brisk; as, a fresh wind.'),
(30568, 'Fresh', 'superl', 'Not salt; as, fresh water, in distinction from that\n   which is from the sea, or brackish; fresh meat, in distinction from\n   that which is pickled or salted.'),
(30569, 'Freshes', 'pl. ', 'of Fresh'),
(30570, 'Fresh', 'n.', 'A stream or spring of fresh water.'),
(30571, 'Fresh', 'n.', 'A flood; a freshet.'),
(30572, 'Fresh', 'n.', 'The mingling of fresh water with salt in rivers or bays, as\n   by means of a flood of fresh water flowing toward or into the sea.'),
(30573, 'Fresh', 'v. t.', 'To refresh; to freshen.'),
(30574, 'Freshen', 'v. t.', 'To make fresh; to separate, as water, from saline\n   ingredients; to make less salt; as, to freshen water, fish, or flesh.'),
(30575, 'Freshen', 'v. t.', 'To refresh; to revive.'),
(30576, 'Freshen', 'v. t.', 'To relieve, as a rope, by change of place where\n   friction wears it; or to renew, as the material used to prevent\n   chafing; as, to freshen a hawse.'),
(30577, 'Freshen', 'v. i.', 'To grow fresh; to lose saltness.'),
(30578, 'Freshen', 'v. i.', 'To grow brisk or strong; as, the wind freshens.'),
(30579, 'Freshet', 'a.', 'A stream of fresh water.'),
(30580, 'Freshet', 'a.', 'A flood or overflowing of a stream caused by heavy rains\n   or melted snow; a sudden inundation.'),
(30581, 'Freshly', 'adv.', 'In a fresh manner; vigorously; newly, recently;\n   brightly; briskly; coolly; as, freshly gathered; freshly painted; the\n   wind blows freshly.'),
(30582, 'Freshmen', 'pl. ', 'of Freshman'),
(30583, 'Freshman', 'n.', 'novice; one in the rudiments of knowledge; especially, a\n   student during his fist year in a college or university.'),
(30584, 'Fretted', 'imp. & p. p.', 'of Fret'),
(30585, 'Fretting', 'p. pr. & vb. n.', 'of Fret'),
(30586, 'Fretful', 'a.', 'Disposed to fret; ill-humored; peevish; angry; in a state\n   of vexation; as, a fretful temper.'),
(30587, 'Frett', 'n.', 'The worn side of the bank of a river. See 4th Fret, n., 4.'),
(30588, 'Frett', 'n.', 'A vitreous compound, used by potters in glazing, consisting\n   of lime, silica, borax, lead, and soda.'),
(30589, 'Fretted', 'p. p. & a.', 'Rubbed or worn away; chafed.'),
(30590, 'Fretted', 'p. p. & a.', 'Agitated; vexed; worried.'),
(30591, 'Fretted', 'p. p. & a.', 'Ornamented with fretwork; furnished with frets;\n   variegated; made rough on the surface.'),
(30592, 'Fretted', 'p. p. & a.', 'Interlaced one with another; -- said of charges\n   and ordinaries.'),
(30593, 'Fretten', 'a.', 'Rubbed; marked; as, pock-fretten, marked with the\n   smallpox.'),
(30594, 'Fretter', 'n.', 'One who, or that which, frets.'),
(30595, 'Fretty', 'a.', 'Adorned with fretwork.'),
(30596, 'Freta', 'pl. ', 'of Fretum'),
(30597, 'Fretum', 'n.', 'A strait, or arm of the sea.'),
(30598, 'Fretwork', 'n.', 'Work adorned with frets; ornamental openwork or work in\n   relief, esp. when elaborate and minute in its parts. Hence, any minute\n   play of light and shade, dark and light, or the like.'),
(30599, 'Freya', 'n.', 'The daughter of Njord, and goddess of love and beauty; the\n   Scandinavian Venus; -- in Teutonic myths confounded with Frigga, but in\n   Scandinavian, distinct.'),
(30600, 'Friable', 'a.', 'Easily crumbled, pulverized, or reduced to powder.'),
(30601, 'Friar', 'n.', 'A brother or member of any religious order, but especially\n   of one of the four mendicant orders, viz: (a) Minors, Gray Friars, or\n   Franciscans. (b) Augustines. (c) Dominicans or Black Friars. (d) White\n   Friars or Carmelites. See these names in the Vocabulary.'),
(30602, 'Friar', 'n.', 'A white or pale patch on a printed page.'),
(30603, 'Friar', 'n.', 'An American fish; the silversides.'),
(30604, 'Friarly', 'a.', 'Like a friar; inexperienced.'),
(30605, 'Friary', 'n.', 'Like a friar; pertaining to friars or to a convent.'),
(30606, 'Friary', 'n.', 'A monastery; a convent of friars.'),
(30607, 'Friary', 'n.', 'The institution or praactices of friars.'),
(30608, 'Friation', 'n.', 'The act of breaking up or pulverizing.'),
(30609, 'Frible', 'a.', 'Frivolous; trifling; sily.'),
(30610, 'Fribble', 'n.', 'A frivolous, contemptible fellow; a fop.'),
(30611, 'Fribble', 'v. i.', 'To act in a trifling or foolish manner; to act\n   frivolously.'),
(30612, 'Fribble', 'v. i.', 'To totter.'),
(30613, 'Fribbler', 'n.', 'A trifler; a fribble.'),
(30614, 'Friborg', 'n.', 'Alt. of Friborgh'),
(30615, 'Friborgh', 'n.', 'The pledge and tithing, afterwards called by the Normans\n   frankpledge. See Frankpledge.'),
(30616, 'Fricace', 'n.', 'Meat sliced and dressed with strong sauce.'),
(30617, 'Fricace', 'n.', 'An unguent; also, the act of rubbing with the unguent.'),
(30618, 'Fricando', 'n.', 'A ragout or fricassee of veal; a fancy dish of veal or of\n   boned turkey, served as an entree, -- called also fricandel.'),
(30619, 'Frickle', 'n.', 'A bushel basket.'),
(30620, 'Ftiction', 'n.', 'The act of rubbing the surface of one body against that\n   of another; attrition; in hygiene, the act of rubbing the body with the\n   hand, with flannel, or with a brush etc., to excite the skin to healthy\n   action.'),
(30621, 'Ftiction', 'n.', 'The resistance which a body meets with from the surface\n   on which it moves. It may be resistance to sliding motion, or to\n   rolling motion.'),
(30622, 'Ftiction', 'n.', 'A clashing between two persons or parties in opinions or\n   work; a disagreement tending to prevent or retard progress.'),
(30623, 'Friday', 'n.', 'The sixth day of the week, following Thursday and preceding\n   Saturday.'),
(30624, 'Fridge', 'n.', 'To rub; to fray.'),
(30625, 'Fridstol', 'n.', 'Alt. of Frithstool'),
(30626, 'Fried', '', 'imp. & p. p. of Fry.'),
(30627, 'Friend', 'n.', 'One who entertains for another such sentiments of esteem,\n   respect, and affection that he seeks his society aud welfare; a\n   wellwisher; an intimate associate; sometimes, an attendant.'),
(30628, 'Friend', 'n.', 'One not inimical or hostile; one not a foe or enemy; also,\n   one of the same nation, party, kin, etc., whose friendly feelings may\n   be assumed. The word is some times used as a term of friendly address.'),
(30629, 'Friend', 'n.', 'One who looks propitiously on a cause, an institution, a\n   project, and the like; a favorer; a promoter; as, a friend to commerce,\n   to poetry, to an institution.'),
(30630, 'Friend', 'n.', 'One of a religious sect characterized by disuse of outward\n   rites and an ordained ministry, by simplicity of dress and speech, and\n   esp. by opposition to war and a desire to live at peace with all men.\n   They are popularly called Quakers.'),
(30631, 'Friend', 'n.', 'A paramour of either sex.'),
(30632, 'Friended', 'imp. & p. p.', 'of Friend'),
(30633, 'Friend', 'v. t.', 'To act as the friend of; to favor; to countenance; to\n   befriend.'),
(30634, 'Friended', 'a.', 'Having friends;'),
(30635, 'Friended', 'a.', 'Inclined to love; well-disposed.'),
(30636, 'Friendly', 'a.', 'Having the temper and disposition of a friend; disposed\n   to promote the good of another; kind; favorable.'),
(30637, 'Friendly', 'a.', 'Appropriate to, or implying, friendship; befitting\n   friends; amicable.'),
(30638, 'Friendly', 'a.', 'Not hostile; as, a friendly power or state.'),
(30639, 'Friendly', 'a.', 'Promoting the good of any person; favorable; propitious;\n   serviceable; as, a friendly breeze or gale.'),
(30640, 'Friendly', 'adv.', 'In the manner of friends; amicably; like friends.'),
(30641, 'Frier', 'n.', 'One who fries.'),
(30642, 'Friese', 'n.', 'Same as Friesic, n.'),
(30643, 'Friesic', 'a.', 'Of or pertaining to Friesland, a province in the northern\n   part of the Netherlands.'),
(30644, 'Friesic', 'n.', 'The language of the Frisians, a Teutonic people formerly\n   occupying a large part of the coast of Holland and Northwestern\n   Germany. The modern dialects of Friesic are spoken chiefly in the\n   province of Friesland, and on some of the islands near the coast of\n   Germany and Denmark.'),
(30645, 'Friesish', 'a.', 'Friesic.'),
(30646, 'Frieze', 'n.', 'That part of the entablature of an order which is between\n   the architrave and cornice. It is a flat member or face, either uniform\n   or broken by triglyphs, and often enriched with figures and other\n   ornaments of sculpture.'),
(30647, 'Frieze', 'n.', 'Any sculptured or richly ornamented band in a building or,\n   by extension, in rich pieces of furniture. See Illust. of Column.'),
(30648, 'Frieze', 'n.', 'A kind of coarse woolen cloth or stuff with a shaggy or\n   tufted (friezed) nap on one side.'),
(30649, 'Frieze', 'v. t.', 'To make a nap on (cloth); to friz. See Friz, v. t., 2.'),
(30650, 'Friezed', 'a.', 'Gathered, or having the map gathered, into little tufts,\n   knots, or protuberances. Cf. Frieze, v. t., and Friz, v. t., 2.'),
(30651, 'Friezer', 'n.', 'One who, or that which, friezes or frizzes.'),
(30652, 'Frigate', 'n.', 'Originally, a vessel of the Mediterranean propelled by\n   sails and by oars. The French, about 1650, transferred the name to\n   larger vessels, and by 1750 it had been appropriated for a class of war\n   vessels intermediate between corvettes and ships of the line. Frigates,\n   from about 1750 to 1850, had one full battery deck and, often, a spar\n   deck with a lighter battery. They carried sometimes as many as fifty\n   guns. After the application of steam to navigation steam frigates of\n   largely increased size and power were built, and formed the main part\n   of the navies of the world till about 1870, when the introduction of\n   ironclads superseded them.'),
(30653, 'Frigate', 'n.', 'Any small vessel on the water.'),
(30654, 'Frigg', 'n.', 'Alt. of Frigga'),
(30655, 'Frigga', 'n.', 'The wife of Odin and mother of the gods; the supreme\n   goddess; the Juno of the Valhalla. Cf. Freya.'),
(30656, 'Fright', 'n.', 'A state of terror excited by the sudden appearance of\n   danger; sudden and violent fear, usually of short duration; a sudden\n   alarm.'),
(30657, 'Fright', 'n.', 'Anything strange, ugly or shocking, producing a feeling of\n   alarm or aversion.'),
(30658, 'Frighted', 'imp.', 'of Fright'),
(30659, 'Fright', 'n.', 'To alarm suddenly; to shock by causing sudden fear; to\n   terrify; to scare.'),
(30660, 'Frighten', 'v. t.', 'To disturb with fear; to throw into a state of alarm\n   or fright; to affright; to terrify.'),
(30661, 'Frigid', 'a.', 'Cold; wanting heat or warmth; of low temperature; as, a\n   frigid climate.'),
(30662, 'Frigid', 'a.', 'Wanting warmth, fervor, ardor, fire, vivacity, etc.;\n   unfeeling; forbidding in manner; dull and unanimated; stiff and formal;\n   as, a frigid constitution; a frigid style; a frigid look or manner;\n   frigid obedience or service.'),
(30663, 'Frigid', 'a.', 'Wanting natural heat or vigor sufficient to excite the\n   generative power; impotent.'),
(30664, 'Frigidly', 'adv.', 'In a frigid manner; coldly; dully; without affection.'),
(30665, 'Frilled', 'imp. & p. p.', 'of Frill'),
(30666, 'Frilling', 'p. pr. & vb. n.', 'of Frill'),
(30667, 'Frill', 'v. i.', 'To shake or shiver as with cold; as, the hawk frills.'),
(30668, 'Frill', 'v. i.', 'To wrinkle; -- said of the gelatin film.'),
(30669, 'Frill', 'v. t.', 'To provide or decorate with a frill or frills; to turn\n   back. in crimped plaits; as, to frill a cap.'),
(30670, 'Frill', 'v. i.', 'A ruffing of a bird\'s feathers from cold.'),
(30671, 'Frill', 'v. i.', 'A ruffle, consisting of a fold of membrane, of hairs, or\n   of feathers, around the neck of an animal.'),
(30672, 'Frill', 'v. i.', 'A similar ruffle around the legs or other appendages of\n   animals.'),
(30673, 'Frill', 'v. i.', 'A ruffled varex or fold on certain shells.'),
(30674, 'Frill', 'v. i.', 'A border or edging secured at one edge and left free at\n   the other, usually fluted or crimped like a very narrow flounce.'),
(30675, 'Frilled', 'a.', 'Furnished with a frill or frills.'),
(30676, 'Frimaire', 'n.', 'The third month of the French republican calendar. It\n   commenced November 21, and ended December 20., See Vendemiaire.'),
(30677, 'Fringe', 'n.', 'An ornamental appendage to the border of a piece of stuff,\n   originally consisting of the ends of the warp, projecting beyond the\n   woven fabric; but more commonly made separate and sewed on, consisting\n   sometimes of projecting ends, twisted or plaited together, and\n   sometimes of loose threads of wool, silk, or linen, or narrow strips of\n   leather, or the like.'),
(30678, 'Fringe', 'n.', 'Something resembling in any respect a fringe; a line of\n   objects along a border or edge; a border; an edging; a margin; a\n   confine.'),
(30679, 'Fringe', 'n.', 'One of a number of light or dark bands, produced by the\n   interference of light; a diffraction band; -- called also interference\n   fringe.'),
(30680, 'Fringe', 'n.', 'The peristome or fringelike appendage of the capsules of\n   most mosses. See Peristome.'),
(30681, 'Fringed', 'imp. & p. p.', 'of Fringe'),
(30682, 'Fringing', 'p. pr. & vb. a.', 'of Fringe'),
(30683, 'Fringe', 'v. t.', 'To adorn the edge of with a fringe or as with a fringe.'),
(30684, 'Fringed', 'a.', 'Furnished with a fringe.'),
(30685, 'Fringent', 'a.', 'Encircling like a fringe; bordering.'),
(30686, 'Fringy', 'a.', 'Aborned with fringes.'),
(30687, 'Fripper', 'n.', 'One who deals in frippery or in old clothes.'),
(30688, 'Frippery', 'n.', 'Coast-off clothes.'),
(30689, 'Frippery', 'n.', 'Hence: Secondhand finery; cheap and tawdry decoration;\n   affected elegance.'),
(30690, 'Frippery', 'n.', 'A place where old clothes are sold.'),
(30691, 'Frippery', 'n.', 'The trade or traffic in old clothes.'),
(30692, 'Frippery', 'a.', 'Trifling; contemptible.'),
(30693, 'Friseur', 'n.', 'A hairdresser.'),
(30694, 'Frisian', 'a.', 'Of or pertaining to Friesland, a province of the\n   Netherlands; Friesic.'),
(30695, 'Frisian', 'n.', 'A native or inhabitant of Friesland; also, the language\n   spoken in Friesland. See Friesic, n.'),
(30696, 'Frisk', 'a.', 'Lively; brisk; frolicsome; frisky.'),
(30697, 'Frisk', 'a.', 'A frolic; a fit of wanton gayety; a gambol: a little playful\n   skip or leap.'),
(30698, 'Frisked', 'imp. & p. p.', 'of Frisk'),
(30699, 'Frisking', 'p. pr. & vb. n.', 'of Frisk'),
(30700, 'Frisk', 'v. i.', 'To leap, skip, dance, or gambol, in fronc and gayety.'),
(30701, 'Friskal', 'n.', 'A leap or caper.'),
(30702, 'Frisker', 'n.', 'One who frisks; one who leaps of dances in gayety; a\n   wanton; an inconstant or unsettled person.'),
(30703, 'Frisket', 'a.', 'The light frame which holds the sheet of paper to the\n   tympan in printing.'),
(30704, 'Friskful', 'a.', 'Brisk; lively; frolicsome.'),
(30705, 'Friskily', 'adv.', 'In a frisky manner.'),
(30706, 'Frisky', 'a.', 'Inclined to frisk; frolicsome; gay.'),
(30707, 'Frislet', 'n.', 'A kind of small ruffle.'),
(30708, 'Frist', 'v. t.', 'To sell upon credit, as goods.'),
(30709, 'Frisure', 'n.', 'The dressing of the hair by crisping or curling.'),
(30710, 'Fritted', 'imp. & p. p.', 'of Frit'),
(30711, 'Fritting', 'p. pr. & vb. n.', 'of Frit'),
(30712, 'Frith', 'n.', 'A narrow arm of the sea; an estuary; the opening of a river\n   into the sea; as, the Frith of Forth.'),
(30713, 'Frith', 'n.', 'A kind of weir for catching fish.'),
(30714, 'Frith', 'a.', 'A forest; a woody place.'),
(30715, 'Frith', 'a.', 'A small field taken out of a common, by inclosing it; an\n   inclosure.'),
(30716, 'Frithy', 'a.', 'Woody.'),
(30717, 'Fritter', 'v. t.', 'A small quantity of batter, fried in boiling lard or in\n   a frying pan. Fritters are of various kinds, named from the substance\n   inclosed in the batter; as, apple fritters, clam fritters, oyster\n   fritters.'),
(30718, 'Fritter', 'v. t.', 'A fragment; a shred; a small piece.'),
(30719, 'Fritter', 'v. t.', 'To cut, as meat, into small pieces, for frying.'),
(30720, 'Fritter', 'v. t.', 'To break into small pieces or fragments.'),
(30721, 'Fritting', 'n.', 'The formation of frit or slag by heat with but incipient\n   fusion.'),
(30722, 'Frizzed', 'imp. & p. p.', 'of Friz'),
(30723, 'Frizzing', 'p. pr. & vb. n.', 'of Friz'),
(30724, 'Frizzes', 'pl. ', 'of Friz'),
(30725, 'Frize', 'n.', 'See 1st Frieze.'),
(30726, 'Frizel', 'a.', 'A movable furrowed piece of steel struck by the flint, to\n   throw sparks into the pan, in an early form of flintlock.'),
(30727, 'Frizette', 'n.', 'A curl of hair or silk; a pad of frizzed hair or silk\n   worn by women under the hair to stuff it out.'),
(30728, 'Frizz', 'v. t. & n.', 'See Friz, v. t. & n.'),
(30729, 'Frizzled', 'imp. & p. p.', 'of Frizzle'),
(30730, 'Frizzle', 'v. t.', 'To curl or crisp, as hair; to friz; to crinkle.'),
(30731, 'Frizzle', 'n.', 'A curl; a lock of hair crisped.'),
(30732, 'Frizzler', 'n.', 'One who frizzles.'),
(30733, 'Frizzly', 'a.', 'Alt. of Frizzy'),
(30734, 'Frizzy', 'a.', 'Curled or crisped; as, frizzly, hair.'),
(30735, 'Frock', 'n.', 'A loose outer garment; especially, a gown forming a part of\n   European modern costume for women and children; also, a coarse\n   shirtlike garment worn by some workmen over their other clothes; a\n   smock frock; as, a marketman\'s frock.'),
(30736, 'Frock', 'n.', 'A coarse gown worn by monks or friars, and supposed to take\n   the place of all, or nearly all, other garments. It has a hood which\n   can be drawn over the head at pleasure, and is girded by a cord.'),
(30737, 'Frock', 'v. t.', 'To clothe in a frock.'),
(30738, 'Frock', 'v. t.', 'To make a monk of. Cf. Unfrock.'),
(30739, 'Frocked', 'a.', 'Clothed in a frock.'),
(30740, 'Frogbit', 'n.', 'A European plant (Hydrocharis Morsus-ranae), floating on\n   still water and propagating itself by runners. It has roundish leaves\n   and small white flowers.'),
(30741, 'Frogbit', 'n.', 'An American plant (Limnobium Spongia), with similar\n   habits.'),
(30742, 'Frogfish', 'n.', 'See Angler, n., 2.'),
(30743, 'Frogfish', 'n.', 'An oceanic fish of the genus Antennarius or\n   Pterophrynoides; -- called also mousefish and toadfish.'),
(30744, 'Frogged', 'a.', 'Provided or ornamented with frogs; as, a frogged coat. See\n   Frog, n., 4.'),
(30745, 'Froggy', 'a.', 'Abounding in frogs.'),
(30746, 'Froise', 'n.', 'A kind of pancake. See 1st Fraise.'),
(30747, 'Frolic', 'a.', 'Full of levity; dancing, playing, or frisking about; full\n   of pranks; frolicsome; gay; merry.'),
(30748, 'Frolic', 'n.', 'A wild prank; a flight of levity, or of gayety and mirth.'),
(30749, 'Frolic', 'n.', 'A scene of gayety and mirth, as in lively play, or in\n   dancing; a merrymaking.'),
(30750, 'Frolic', 'v. i.', 'To play wild pranks; to play tricks of levity, mirth,\n   and gayety; to indulge in frolicsome play; to sport.'),
(30751, 'Frolicky', 'a.', 'Frolicsome.'),
(30752, 'Frolicly', 'adv.', 'In a frolicsome manner; with mirth and gayety.'),
(30753, 'Fromward', 'prep.', 'Alt. of Fromwards'),
(30754, 'Frond', 'n.', 'The organ formed by the combination or union into one body\n   of stem and leaf, and often bearing the fructification; as, the frond\n   of a fern or of a lichen or seaweed; also, the peculiar leaf of a palm\n   tree.'),
(30755, 'Fronde', 'n.', 'A political party in France, during the minority of Louis\n   XIV., who opposed the government, and made war upon the court party.'),
(30756, 'Fronded', 'a.', 'Furnished with fronds.'),
(30757, 'Frondent', 'a.', 'Covered with leaves; leafy; as, a frondent tree.'),
(30758, 'Frondeur', 'n.', 'A member of the Fronde.'),
(30759, 'Frondlet', 'n.', 'A very small frond, or distinct portion of a compound\n   frond.'),
(30760, 'Frondose', 'a.', 'Frond bearing; resembling a frond; having a simple\n   expansion not separable into stem and leaves.'),
(30761, 'Frondose', 'a.', 'Leafy.'),
(30762, 'Frondous', 'a.', 'Frondose.'),
(30763, 'Frons', 'n.', 'The forehead; the part of the cranium between the orbits and\n   the vertex.'),
(30764, 'Front', 'n.', 'The forehead or brow, the part of the face above the eyes;\n   sometimes, also, the whole face.'),
(30765, 'Front', 'n.', 'The forehead, countenance, or personal presence, as\n   expressive of character or temper, and especially, of boldness of\n   disposition, sometimes of impudence; seeming; as, a bold front; a\n   hardened front.'),
(30766, 'Front', 'n.', 'The part or surface of anything which seems to look out, or\n   to be directed forward; the fore or forward part; the foremost rank;\n   the van; -- the opposite to back or rear; as, the front of a house; the\n   front of an army.'),
(30767, 'Front', 'n.', 'A position directly before the face of a person, or before\n   the foremost part of a thing; as, in front of un person, of the troops,\n   or of a house.'),
(30768, 'Front', 'n.', 'The most conspicuous part.'),
(30769, 'Front', 'n.', 'That which covers the foremost part of the head: a front\n   piece of false hair worn by women.'),
(30770, 'Front', 'n.', 'The beginning.'),
(30771, 'Front', 'a.', 'Of or relating to the front or forward part; having a\n   position in front; foremost; as, a front view.'),
(30772, 'Fronted', 'imp. & p. p.', 'of Front'),
(30773, 'Fronting', 'p. pr. & vb. n.', 'of Front'),
(30774, 'Front', 'v. t.', 'To oppose face to face; to oppose directly; to meet in a\n   hostile manner.'),
(30775, 'Front', 'v. t.', 'To appear before; to meet.'),
(30776, 'Front', 'v. t.', 'To face toward; to have the front toward; to confront;\n   as, the house fronts the street.'),
(30777, 'Front', 'v. t.', 'To stand opposed or opposite to, or over against as, his\n   house fronts the church.'),
(30778, 'Front', 'v. t.', 'To adorn in front; to supply a front to; as, to front a\n   house with marble; to front a head with laurel.'),
(30779, 'Front', 'v. t.', 'To have or turn the face or front in any direction; as,\n   the house fronts toward the east.'),
(30780, 'Frontage', 'n.', 'The front part of an edifice or lot; extent of front.'),
(30781, 'Frontal', 'a.', 'Belonging to the front part; being in front'),
(30782, 'Frontal', 'a.', 'Of or pertaining to the forehead or the anterior part of\n   the roof of the brain case; as, the frontal bones.'),
(30783, 'Frontal', 'n.', 'Something worn on the forehead or face; a frontlet'),
(30784, 'Frontal', 'n.', 'An ornamental band for the hair.'),
(30785, 'Frontal', 'n.', 'The metal face guard of a soldier.'),
(30786, 'Frontal', 'n.', 'A little pediment over a door or window.'),
(30787, 'Frontal', 'n.', 'A movable, decorative member in metal, carved wood, or,\n   commonly, in rich stuff or in embroidery, covering the front of the\n   altar. Frontals are usually changed according to the different\n   ceremonies.'),
(30788, 'Frontal', 'n.', 'A medicament or application for the forehead.'),
(30789, 'Frontal', 'n.', 'The frontal bone, or one of the two frontal bones, of the\n   cranium.'),
(30790, 'Frontate', 'a.', 'Alt. of Fron\'tated'),
(30791, 'Fronted', 'a.', 'Formed with a front; drawn up in line.'),
(30792, 'Frontier', 'n.', 'That part of a country which fronts or faces another\n   country or an unsettled region; the marches; the border, confine, or\n   extreme part of a country, bordering on another country; the border of\n   the settled and cultivated part of a country; as, the frontier of\n   civilization.'),
(30793, 'Frontier', 'n.', 'An outwork.'),
(30794, 'Frontier', 'a.', 'Lying on the exterior part; bordering; conterminous; as,\n   a frontier town.'),
(30795, 'Frontier', 'a.', 'Of or relating to a frontier.'),
(30796, 'Frontier', 'v. i.', 'To constitute or form a frontier; to have a frontier;\n   -- with on.'),
(30797, 'Frontlet', 'n.', 'A frontal or brow band; a fillet or band worn on the\n   forehead.'),
(30798, 'Frontlet', 'n.', 'A frown (likened to a frontlet).'),
(30799, 'Frontlet', 'n.', 'The margin of the head, behind the bill of birds, often\n   bearing rigid bristles.'),
(30800, 'Fronto-', '', 'A combining form signifying relating to the forehead or the\n   frontal bone; as, fronto-parietal, relating to the frontal and the\n   parietal bones; fronto-nasal, etc.'),
(30801, 'Fronton', 'n.', 'Same as Frontal, 2.'),
(30802, 'Froppish', 'a.', 'Peevish; froward.'),
(30803, 'Frore', 'adv.', 'Frostily.'),
(30804, 'Frorn', 'p. a.', 'Frozen.'),
(30805, 'Frory', 'a.', 'Frozen; stiff with cold.'),
(30806, 'Frory', 'a.', 'Covered with a froth like hoarfrost.'),
(30807, 'Frost', 'v. i.', 'The act of freezing; -- applied chiefly to the\n   congelation of water; congelation of fluids.'),
(30808, 'Frost', 'v. i.', 'The state or temperature of the air which occasions\n   congelation, or the freezing of water; severe cold or freezing weather.'),
(30809, 'Frost', 'v. i.', 'Frozen dew; -- called also hoarfrost or white frost.'),
(30810, 'Frost', 'v. i.', 'Coldness or insensibility; severity or rigidity of\n   character.'),
(30811, 'Frostted', 'imp. & p. p.', 'of Frost'),
(30812, 'Frosting', 'p. pr. & vb. n.', 'of Frost'),
(30813, 'Frost', 'v. t.', 'To injure by frost; to freeze, as plants.'),
(30814, 'Frost', 'v. t.', 'To cover with hoarfrost; to produce a surface resembling\n   frost upon, as upon cake, metals, or glass.'),
(30815, 'Frost', 'v. t.', 'To roughen or sharpen, as the nail heads or calks of\n   horseshoes, so as to fit them for frosty weather.'),
(30816, 'Frosted', 'a.', 'Covered with hoarfrost or anything resembling hoarfrost;\n   ornamented with frosting; also, frost-bitten; as, a frosted cake;\n   frosted glass.'),
(30817, 'Frostily', 'adv.', 'In a frosty manner.'),
(30818, 'Frosting', 'n.', 'A composition of sugar and beaten egg, used to cover or\n   ornament cake, pudding, etc.'),
(30819, 'Frosting', 'n.', 'A lusterless finish of metal or glass; the process of\n   producing such a finish.'),
(30820, 'Frosty', 'a.', 'Attended with, or producing, frost; having power to congeal\n   water; cold; freezing; as, a frosty night.'),
(30821, 'Frosty', 'a.', 'Covered with frost; as, the grass is frosty.'),
(30822, 'Frosty', 'a.', 'Chill in affection; without warmth of affection or courage.'),
(30823, 'Frosty', 'a.', 'Appearing as if covered with hoarfrost; white; gray-haired;\n   as, a frosty head.'),
(30824, 'Frote', 'v. t.', 'To rub or wear by rubbing; to chafe.'),
(30825, 'Froterer', 'n.', 'One who frotes; one who rubs or chafes.'),
(30826, 'Froth', 'n.', 'The bubbles caused in fluids or liquors by fermentation or\n   agitation; spume; foam; esp., a spume of saliva caused by disease or\n   nervous excitement.'),
(30827, 'Froth', 'n.', 'Any empty, senseless show of wit or eloquence; rhetoric\n   without thought.'),
(30828, 'Froth', 'n.', 'Light, unsubstantial matter.'),
(30829, 'Frothed', 'imp. & p. p.', 'of Froth'),
(30830, 'Frothing', 'p. pr. & vb. n.', 'of Froth'),
(30831, 'Froth', 'v. t.', 'To cause to foam.'),
(30832, 'Froth', 'v. t.', 'To spit, vent, or eject, as froth.'),
(30833, 'Froth', 'v. t.', 'To cover with froth; as, a horse froths his chain.'),
(30834, 'Froth', 'v. i.', 'To throw up or out spume, foam, or bubbles; to foam; as\n   beer froths; a horse froths.'),
(30835, 'Frothily', 'adv.', 'In a frothy manner.'),
(30836, 'Frothing', 'n.', 'Exaggerated declamation; rant.'),
(30837, 'Frothy', 'superl.', 'Full of foam or froth, or consisting of froth or light\n   bubbles; spumous; foamy.'),
(30838, 'Frothy', 'superl.', 'Not firm or solid; soft; unstable.'),
(30839, 'Frothy', 'superl.', 'Of the nature of froth; light; empty; unsubstantial;\n   as, a frothy speaker or harangue.'),
(30840, 'Frounced', 'imp. & p. p.', 'of Frounce'),
(30841, 'Frounce', 'v. i.', 'To gather into or adorn with plaits, as a dress; to\n   form wrinkles in or upon; to curl or frizzle, as the hair.'),
(30842, 'Frounce', 'v. i.', 'To form wrinkles in the forehead; to manifest\n   displeasure; to frown.'),
(30843, 'Frounce', 'n.', 'A wrinkle, plait, or curl; a flounce; -- also, a frown.'),
(30844, 'Frounce', 'n.', 'An affection in hawks, in which white spittle gathers\n   about the hawk\'s bill.'),
(30845, 'Frouzy', 'a.', 'Fetid, musty; rank; disordered and offensive to the smell\n   or sight; slovenly; dingy. See Frowzy.'),
(30846, 'Froward', 'a.', 'Not willing to yield or compIy with what is required or is\n   reasonable; perverse; disobedient; peevish; as, a froward child.'),
(30847, 'Frower', 'n.', 'A tool. See 2d Frow.'),
(30848, 'Frowey', 'a.', 'Working smoothly, or without splitting; -- said of timber.'),
(30849, 'Frowned', 'imp. &, p. p.', 'of Frown'),
(30850, 'Frowning', 'p. pr. & vb. n.', 'of Frown'),
(30851, 'Frown', 'v. i.', 'To contract the brow in displeasure, severity, or\n   sternness; to scowl; to put on a stern, grim, or surly look.'),
(30852, 'Frown', 'v. i.', 'To manifest displeasure or disapprobation; to look with\n   disfavor or threateningly; to lower; as, polite society frowns upon\n   rudeness.'),
(30853, 'Frown', 'v. t.', 'To repress or repel by expressing displeasure or\n   disapproval; to rebuke with a look; as, frown the impudent fellow into\n   silence.'),
(30854, 'Frown', 'n.', 'A wrinkling of the face in displeasure, rebuke, etc.; a\n   sour, severe, or stere look; a scowl.'),
(30855, 'Frown', 'n.', 'Any expression of displeasure; as, the frowns of Providence;\n   the frowns of Fortune.'),
(30856, 'Frowny', 'a.', 'Frowning; scowling.'),
(30857, 'Frowy', 'a.', 'Musty. rancid; as, frowy butter.'),
(30858, 'Frowzy', 'a.', 'Slovenly; unkempt; untidy; frouzy.'),
(30859, 'Froze', '', 'imp. of Freeze.'),
(30860, 'Frozen', 'a.', 'Congealed with cold; affected by freezing; as, a frozen\n   brook.'),
(30861, 'Frozen', 'a.', 'Subject to frost, or to long and severe cold; chilly; as,\n   the frozen north; the frozen zones.'),
(30862, 'Frozen', 'a.', 'Cold-hearted; unsympathetic; unyielding.'),
(30863, 'Frubish', 'v. t.', 'To rub up: to furbish.'),
(30864, 'Fructed', 'a.', 'Bearing fruit; -- said of a tree or plant so represented\n   upon an escutcheon.'),
(30865, 'Fructify', 'v. i.', 'To bear fruit.'),
(30866, 'Fructify', 'v. t.', 'To make fruitful; to render productive; to fertilize;\n   as, to fructify the earth.'),
(30867, 'Fructose', 'n.', 'Fruit sugar; levulose.'),
(30868, 'Fructure', 'n.', 'Use; fruition; enjoyment.'),
(30869, 'Frugal', 'n.', 'Economical in the use or appropriation of resources; not\n   wasteful or lavish; wise in the expenditure or application of force,\n   materials, time, etc.; characterized by frugality; sparing; economical;\n   saving; as, a frugal housekeeper; frugal of time.'),
(30870, 'Frugal', 'n.', 'Obtained by, or appropriate to, economy; as, a frugal\n   fortune.'),
(30871, 'Frugally', 'adv.', 'Thriftily; prudently.'),
(30872, 'Fruit', 'v. t.', 'Whatever is produced for the nourishment or enjoyment of\n   man or animals by the processes of vegetable growth, as corn, grass,\n   cotton, flax, etc.; -- commonly used in the plural.'),
(30873, 'Fruit', 'v. t.', 'The pulpy, edible seed vessels of certain plants,\n   especially those grown on branches above ground, as apples, oranges,\n   grapes, melons, berries, etc. See 3.'),
(30874, 'Fruit', 'v. t.', 'The ripened ovary of a flowering plant, with its contents\n   and whatever parts are consolidated with it.'),
(30875, 'Fruit', 'v. t.', 'The spore cases or conceptacles of flowerless plants, as\n   of ferns, mosses, algae, etc., with the spores contained in them.'),
(30876, 'Fruit', 'v. t.', 'The produce of animals; offspring; young; as, the fruit\n   of the womb, of the loins, of the body.'),
(30877, 'Fruit', 'v. t.', 'That which is produced; the effect or consequence of any\n   action; advantageous or desirable product or result; disadvantageous or\n   evil consequence or effect; as, the fruits of labor, of self-denial, of\n   intemperance.'),
(30878, 'Fruit', 'v. i.', 'To bear fruit.'),
(30879, 'Fruitage', 'n.', 'Fruit, collectively; fruit, in general; fruitery.'),
(30880, 'Fruitage', 'n.', 'Product or result of any action; effect, good or ill.'),
(30881, 'Fruiter', 'a.', 'A ship for carrying fruit.'),
(30882, 'Fruitery', 'n.', 'Fruit, taken collectively; fruitage.'),
(30883, 'Fruitery', 'n.', 'A repository for fruit.'),
(30884, 'Fruitful', 'a.', 'Full of fruit; producing fruit abundantly; bearing\n   results; prolific; fertile; liberal; bountiful; as, a fruitful tree, or\n   season, or soil; a fruitful wife.'),
(30885, 'Fruiting', 'a.', 'Pertaining to, or producing, fruit.'),
(30886, 'Fruiting', 'n.', 'The bearing of fruit.'),
(30887, 'Fruition', 'n.', 'Use or possession of anything, especially such as is\n   accompanied with pleasure or satisfaction; pleasure derived from\n   possession or use.'),
(30888, 'Fruitive', 'a.', 'Enjoying; possessing.'),
(30889, 'Fruity', 'a.', 'Having the odor, taste, or appearance of fruit; also,\n   fruitful.'),
(30890, 'Frumenty', 'n.', 'Food made of hulled wheat boiled in milk, with sugar,\n   plums, etc.'),
(30891, 'Frump', 'v. t.', 'To insult; to flout; to mock; to snub.'),
(30892, 'Frump', 'n.', 'A contemptuous speech or piece of conduct; a gibe or flout.'),
(30893, 'Frump', 'n.', 'A cross, old-fashioned person; esp., an old woman; a gossip.'),
(30894, 'Frumper', 'n.', 'A mocker.'),
(30895, 'Frumpish', 'a.', 'Cross-tempered; scornful.'),
(30896, 'Frumpish', 'a.', 'Old-fashioned, as a woman\'s dress.'),
(30897, 'Frush', 'v. t.', 'To batter; to break in pieces.'),
(30898, 'Frush', 'a.', 'Easily broken; brittle; crisp.'),
(30899, 'Frush', 'n.', 'Noise; clatter; crash.'),
(30900, 'Frush', 'n.', 'The frog of a horse\'s foot.'),
(30901, 'Frush', 'n.', 'A discharge of a fetid or ichorous matter from the frog of a\n   horse\'s foot; -- also caled thrush.'),
(30902, 'Frustule', 'n.', 'The siliceous shell of a diatom. It is composed of two\n   valves, one overlapping the other, like a pill box and its cover.'),
(30903, 'Frusta', 'pl. ', 'of Frustum'),
(30904, 'Frustums', 'pl. ', 'of Frustum'),
(30905, 'Frustum', 'n.', 'The part of a solid next the base, formed by cutting off\n   the, top; or the part of any solid, as of a cone, pyramid, etc.,\n   between two planes, which may be either parallel or inclined to each\n   other.'),
(30906, 'Frustum', 'n.', 'One of the drums of the shaft of a column.'),
(30907, 'Frutage', 'n.', 'A picture of fruit; decoration by representation of fruit.'),
(30908, 'Frutage', 'n.', 'A confection of fruit.'),
(30909, 'Frutex', 'n.', 'A plant having a woody, durable stem, but less than a tree;\n   a shrub.'),
(30910, 'Fried', 'imp. & p. p.', 'of Fry'),
(30911, 'Frying', 'p. pr. & vb. n.', 'of Fry'),
(30912, 'Frying', 'n.', 'The process denoted by the verb fry.'),
(30913, 'Fuage', 'n.', 'Same as Fumage.'),
(30914, 'Fubbery', 'n.', 'Cheating; deception.'),
(30915, 'Fubby', 'a.', 'Alt. of Fubsy'),
(30916, 'Fubsy', 'a.', 'Plump; chubby; short and stuffy; as a fubsy sofa.'),
(30917, 'Fucate', 'a.', 'Alt. of Fucated'),
(30918, 'Fucated', 'a.', 'Painted; disguised with paint, or with false show.'),
(30919, 'Fuchs', 'n.', 'A student of the first year.'),
(30920, 'Fuchsias', 'pl. ', 'of Fuchsia'),
(30921, 'Fuchslae', 'pl. ', 'of Fuchsia'),
(30922, 'Fuchsia', 'n.', 'A genus of flowering plants having elegant drooping\n   flowers, with four sepals, four petals, eight stamens, and a single\n   pistil. They are natives of Mexico and South America. Double-flowered\n   varieties are now common in cultivation.'),
(30923, 'Fuchsine', 'n.', 'Aniline red; an artificial coal-tar dyestuff, of a\n   metallic green color superficially, resembling cantharides, but when\n   dissolved forming a brilliant dark red. It consists of a hydrochloride\n   or acetate of rosaniline. See Rosaniline.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(30924, 'Fucoid', 'a.', 'Properly, belonging to an order of alga: (Fucoideae) which\n   are blackish in color, and produce oospores which are not fertilized\n   until they have escaped from the conceptacle. The common rockweeds and\n   the gulfweed (Sargassum) are fucoid in character.'),
(30925, 'Fucoid', 'a.', 'In a vague sense, resembling seaweeds, or of the nature of\n   seaweeds.'),
(30926, 'Fucoid', 'n.', 'A plant, whether recent or fossil, which resembles a\n   seaweed. See Fucoid, a.'),
(30927, 'Fucoidal', 'a.', 'Fucoid.'),
(30928, 'Fucoidal', 'a.', 'Containing impressions of fossil fucoids or seaweeds; as,\n   fucoidal sandstone.'),
(30929, 'Fucus', 'n.', 'A paint; a dye; also, false show.'),
(30930, 'Fucus', 'n.', 'A genus of tough, leathery seaweeds, usually of a dull\n   brownish green color; rockweed.'),
(30931, 'Fucusol', 'n.', 'An oily liquid, resembling, and possibly identical with,\n   furfurol, and obtained from fucus, and other seaweeds.'),
(30932, 'Fudder', 'n.', 'See Fodder, a weight.'),
(30933, 'Fuddled', 'imp. & p. p.,', 'of Fuddle'),
(30934, 'Fuddling', 'p. pr. & vb. n.', 'of Fuddle'),
(30935, 'Fuddle', 'v. t.', 'To make foolish by drink; to cause to become\n   intoxicated.'),
(30936, 'Fuddle', 'v. i.', 'To drink to excess.'),
(30937, 'Fuddler', 'n.', 'A drunkard.'),
(30938, 'Fudge', 'n.', 'A made-up story; stuff; nonsense; humbug; -- often an\n   exclamation of contempt.'),
(30939, 'Fudged', 'imp. & p. p.', 'of Fudge'),
(30940, 'Fudging', 'p. pr. & vb. n.', 'of Fudge'),
(30941, 'Fudge', 'v. t.', 'To make up; to devise; to contrive; to fabricate.'),
(30942, 'Fudge', 'v. t.', 'To foist; to interpolate.'),
(30943, 'Fuegian', 'a.', 'Of or pertaining to Terra del Fuego.'),
(30944, 'Fuegian', 'n.', 'A native of Terra del Fuego.'),
(30945, 'Fueler', 'n.', 'One who, or that which, supplies fuel.'),
(30946, 'Fuero', 'n.', 'A code; a charter; a grant of privileges.'),
(30947, 'Fuero', 'n.', 'A custom having the force of law.'),
(30948, 'Fuero', 'n.', 'A declaration by a magistrate.'),
(30949, 'Fuero', 'n.', 'A place where justice is administered.'),
(30950, 'Fuero', 'n.', 'The jurisdiction of a tribunal.'),
(30951, 'Fuffy', 'a.', 'Light; puffy.'),
(30952, 'Fugacity', 'a.', 'The quality of being fugacious; fugaclousness;\n   volatility; as, fugacity of spirits.'),
(30953, 'Fugacity', 'a.', 'Uncertainty; instability.'),
(30954, 'Fugacy', 'n.', 'Banishment.'),
(30955, 'Fugato', 'a.', 'in the gugue style, but not strictly like a fugue.'),
(30956, 'Fugato', 'n.', 'A composition resembling a fugue.'),
(30957, 'Fughetta', 'n.', 'a short, condensed fugue.'),
(30958, 'Fugitive', 'a.', 'Fleeing from pursuit, danger, restraint, etc., escaping,\n   from service, duty etc.; as, a fugitive solder; a fugitive slave; a\n   fugitive debtor.'),
(30959, 'Fugitive', 'a.', 'Not fixed; not durable; liable to disappear or fall away;\n   volatile; uncertain; evanescent; liable to fade; -- applied to material\n   and immaterial things; as, fugitive colors; a fugitive idea.'),
(30960, 'Fugitive', 'n.', 'One who flees from pursuit, danger, restraint, service,\n   duty, etc.; a deserter; as, a fugitive from justice.'),
(30961, 'Fugitive', 'n.', 'Something hard to be caught or detained.'),
(30962, 'Fugle', 'v. i.', 'To maneuver; to move hither and thither.'),
(30963, 'Fuglemen', 'pl. ', 'of Fugleman'),
(30964, 'Fugleman', 'n.', 'A soldier especially expert and well drilled, who takes\n   his place in front of a military company, as a guide for the others in\n   their exercises; a file leader. He originally stood in front of the\n   right wing.'),
(30965, 'Fugleman', 'n.', 'Hence, one who leads the way.'),
(30966, 'Fugue', 'n.', 'A polyphonic composition, developed from a given theme or\n   themes, according to strict contrapuntal rules. The theme is first\n   given out by one voice or part, and then, while that pursues its way,\n   it is repeated by another at the interval of a fifth or fourth, and so\n   on, until all the parts have answered one by one, continuing their\n   several melodies and interweaving them in one complex progressive\n   whole, in which the theme is often lost and reappears.'),
(30967, 'Fuguist', 'n.', 'A musician who composes or performs fugues.'),
(30968, 'Fulahs', 'n. pl.', 'Alt. of Foolahs'),
(30969, 'Foolahs', 'n. pl.', 'A peculiar African race of uncertain origin, but\n   distinct from the negro tribes, inhabiting an extensive region of\n   Western Soudan. Their color is brown or yellowish bronze. They are\n   Mohammedans. Called also Fellatahs, Foulahs, and Fellani. Fulah is also\n   used adjectively; as, Fulah empire, tribes, language.'),
(30970, 'Fulbe', 'n.', 'Same as Fulahs.'),
(30971, 'Fuldble', 'a.', 'Capable of being propped up.'),
(30972, 'Fulcra', 'n. pl.', 'See Fulcrum.'),
(30973, 'Fulcrate', 'a.', 'Propped; supported by accessory organs.'),
(30974, 'Fulcrate', 'a.', 'Furnished with fulcrums.'),
(30975, 'Fulcra', 'pl. ', 'of Fulcrum'),
(30976, 'Fulcrums', 'pl. ', 'of Fulcrum'),
(30977, 'Fulcrum', 'n.', 'A prop or support.'),
(30978, 'Fulcrum', 'n.', 'That by which a lever is sustained, or about which it\n   turns in lifting or moving a body.'),
(30979, 'Fulcrum', 'n.', 'An accessory organ such as a tendril, stipule, spine, and\n   the like.'),
(30980, 'Fulcrum', 'n.', 'The horny inferior surface of the lingua of certain\n   insects.'),
(30981, 'Fulcrum', 'n.', 'One of the small, spiniform scales found on the front edge\n   of the dorsal and caudal fins of many ganoid fishes.'),
(30982, 'Fulcrum', 'n.', 'The connective tissue supporting the framework of the\n   retina of the eye.'),
(30983, 'Fulfill', 'v. t.', 'To fill up; to make full or complete.'),
(30984, 'Fulfill', 'v. t.', 'To accomplish or carry into effect, as an intention,\n   promise, or prophecy, a desire, prayer, or requirement, etc.; to\n   complete by performance; to answer the requisitions of; to bring to\n   pass, as a purpose or design; to effectuate.'),
(30985, 'Fulgency', 'n.', 'Brightness; splendor; glitter; effulgence.'),
(30986, 'Fulgent', 'a.', 'Exquisitely bright; shining; dazzling; effulgent.'),
(30987, 'Fulgid', 'a.', 'Shining; glittering; dazzling.'),
(30988, 'Fulgor', 'n.', 'Dazzling brightness; splendor.'),
(30989, 'Fulgury', 'n.', 'Lightning.'),
(30990, 'Fulham', 'n.', 'A false die.'),
(30991, 'Fulimart', 'n.', 'Same as Foumart.'),
(30992, 'Fulled', 'imp. & p. p.', 'of Full'),
(30993, 'Fulling', 'p. pr. & vb. n.', 'of Full'),
(30994, 'Fullage', 'n.', 'The money or price paid for fulling or cleansing cloth.'),
(30995, 'Fullam', 'n.', 'A false die. See Fulham.'),
(30996, 'Fuller', 'v. t.', 'One whose occupation is to full cloth.'),
(30997, 'Fuller', 'a.', 'A die; a half-round set hammer, used for forming grooves\n   and spreading iron; -- called also a creaser.'),
(30998, 'Fuller', 'v. t.', 'To form a groove or channel in, by a fuller or set\n   hammer; as, to fuller a bayonet.'),
(30999, 'Fullery', 'n.', 'The place or the works where the fulling of cloth is\n   carried on.'),
(31000, 'Full-hot', 'a.', 'Very fiery.'),
(31001, 'Fulling', 'n.', 'The process of cleansing, shrinking, and thickening cloth\n   by moisture, heat, and pressure.'),
(31002, 'Fullmart', 'n.', 'See Foumart.'),
(31003, 'Fullness', 'n.', 'The state of being full, or of abounding; abundance;\n   completeness.'),
(31004, 'Fully', 'adv.', 'In a full manner or degree; completely; entirely; without\n   lack or defect; adequately; satisfactorily; as, to be fully persuaded\n   of the truth of a proposition.'),
(31005, 'Fulmar', 'n.', 'One of several species of sea birds, of the family\n   procellariidae, allied to the albatrosses and petrels. Among the\n   well-known species are the arctic fulmar (Fulmarus glacialis) (called\n   also fulmar petrel, malduck, and mollemock), and the giant fulmar\n   (Ossifraga gigantea).'),
(31006, 'Fulmine', 'v.', 'To thunder.'),
(31007, 'Fulmine', 'v. t.', 'To shoot; to dart like lightning; to fulminate; to\n   utter with authority or vehemence.'),
(31008, 'Fulmiaic', 'a.', 'Pertaining to fulmination; detonating; specifically\n   (Chem.), pertaining to, derived from, or denoting, an acid, so called;\n   as, fulminic acid.'),
(31009, 'Falness', 'n.', 'See Fullness.'),
(31010, 'Fulsamic', 'a.', 'Fulsome.'),
(31011, 'Fulsome', 'a.', 'Full; abundant; plenteous; not shriveled.'),
(31012, 'Fulsome', 'a.', 'Offending or disgusting by overfullness, excess, or\n   grossness; cloying; gross; nauseous; esp., offensive from excess of\n   praise; as, fulsome flattery.'),
(31013, 'Fulsome', 'a.', 'Lustful; wanton; obscene; also, tending to obscenity.'),
(31014, 'Fulvid', 'a.', 'Fulvous.'),
(31015, 'Fulvous', 'a.', 'Tawny; dull yellow, with a mixture of gray and brown.'),
(31016, 'Fumades', 'pl. ', 'of Fumado'),
(31017, 'Fumadoes', 'pl. ', 'of Fumado'),
(31018, 'Fumade', 'v. i.', 'Alt. of Fumado'),
(31019, 'Fumado', 'v. i.', 'A salted and smoked fish, as the pilchard.'),
(31020, 'Fumage', 'n.', 'Hearth money.'),
(31021, 'Fumarate', 'n.', 'A salt of fumaric acid.'),
(31022, 'Fumaric', 'a.', 'Pertaining to, or derived from, fumitory (Fumaria\n   officinalis).'),
(31023, 'Fumarine', 'n.', 'An alkaloid extracted from fumitory, as a white\n   crystalline substance.'),
(31024, 'Fumarole', 'n.', 'A hole or spot in a volcanic or other region, from which\n   fumes issue.'),
(31025, 'Fumatory', 'n.', 'See Fumitory.'),
(31026, 'Fumbled', 'imp. & p. p.', 'of Fumble'),
(31027, 'Fumbling', 'p. pr. & vb. n.', 'of Fumble'),
(31028, 'Fumble', 'v. i.', 'To feel or grope about; to make awkward attempts to do\n   or find something.'),
(31029, 'Fumble', 'v. i.', 'To grope about in perplexity; to seek awkwardly; as, to\n   fumble for an excuse.'),
(31030, 'Fumble', 'v. i.', 'To handle much; to play childishly; to turn over and\n   over.'),
(31031, 'Fumble', 'v. t.', 'To handle or manage awkwardly; to crowd or tumble\n   together.'),
(31032, 'Fumbler', 'n.', 'One who fumbles.'),
(31033, 'Fumed', 'imp. & p. p.', 'of Fume'),
(31034, 'Fuming', 'p. pr. & vb. n.', 'of Fume'),
(31035, 'Fumeless', 'a.', 'Free from fumes.'),
(31036, 'Fumer', 'n.', 'One that fumes.'),
(31037, 'Fumer', 'n.', 'One who makes or uses perfumes.'),
(31038, 'Fumerell', 'n.', 'See Femerell.'),
(31039, 'Fumet', 'n.', 'The dung of deer.'),
(31040, 'Fumet', 'n.', 'Alt. of Fumette'),
(31041, 'Fumette', 'n.', 'The stench or high flavor of game or other meat when kept\n   long.'),
(31042, 'Fumetere', 'n.', 'Fumitory.'),
(31043, 'Fumid', 'a.', 'Smoky; vaporous.'),
(31044, 'Fumidity', 'n.', 'Alt. of Fumidness'),
(31045, 'Fumify', 'v. t.', 'To subject to the action of smoke.'),
(31046, 'Fumigant', 'a.', 'Fuming.'),
(31047, 'Fumigate', 'n.', 'To apply smoke to; to expose to smoke or vapor; to\n   purify, or free from infection, by the use of smoke or vapors.'),
(31048, 'Fumigate', 'n.', 'To smoke; to perfume.'),
(31049, 'Fumlly', 'adv.', 'Smokily; with fume.'),
(31050, 'Fuming', 'a.', 'Producing fumes, or vapors.'),
(31051, 'Fumingly', 'adv.', 'In a fuming manner; angrily.'),
(31052, 'Famish', 'a.', 'Smoky; hot; choleric.'),
(31053, 'Fumitez', 'n.', 'Fumitory.'),
(31054, 'Fumitory', 'n.', 'The common uame of several species of the genus Fumaria,\n   annual herbs of the Old World, with finely dissected leaves and small\n   flowers in dense racemes or spikes. F. officinalis is a common species,\n   and was formerly used as an antiscorbutic.'),
(31055, 'Fummel', 'n.', 'A hinny.'),
(31056, 'Fumosity', 'n.', 'The fumes of drink.'),
(31057, 'Fumous', 'a.', 'Producing smoke; smoky.'),
(31058, 'Fumous', 'a.', 'Producing fumes; full of fumes.'),
(31059, 'Function', 'n.', 'The act of executing or performing any duty, office, or\n   calling; per formance.'),
(31060, 'Function', 'n.', 'The appropriate action of any special organ or part of an\n   animal or vegetable organism; as, the function of the heart or the\n   limbs; the function of leaves, sap, roots, etc.; life is the sum of the\n   functions of the various organs and parts of the body.'),
(31061, 'Function', 'n.', 'The natural or assigned action of any power or faculty,\n   as of the soul, or of the intellect; the exertion of an energy of some\n   determinate kind.'),
(31062, 'Function', 'n.', 'The course of action which peculiarly pertains to any\n   public officer in church or state; the activity appropriate to any\n   business or profession.'),
(31063, 'Function', 'n.', 'A quantity so connected with another quantity, that if\n   any alteration be made in the latter there will be a consequent\n   alteration in the former. Each quantity is said to be a function of the\n   other. Thus, the circumference of a circle is a function of the\n   diameter. If x be a symbol to which different numerical values can be\n   assigned, such expressions as x2, 3x, Log. x, and Sin. x, are all\n   functions of x.'),
(31064, 'Function', 'v. i.', 'Alt. of Functionate'),
(31065, 'Funded', 'imp. & p. p.', 'of Fund'),
(31066, 'Funding', 'p. pr. & vb. n.', 'of Fund'),
(31067, 'Fundable', 'a.', 'Capable of being funded, or converted into a fund;\n   convertible into bonds.'),
(31068, 'Funded', 'a.', 'Existing in the form of bonds bearing regular interest; as,\n   funded debt.'),
(31069, 'Funded', 'a.', 'Invested in public funds; as, funded money.'),
(31070, 'Funding', 'a.', 'Providing a fund for the payment of the interest or\n   principal of a debt.'),
(31071, 'Funding', 'a.', 'Investing in the public funds.'),
(31072, 'Funuless', 'a.', 'Destitute of funds.'),
(31073, 'Fundus', 'n.', 'The bottom or base of any hollow organ; as, the fundus of\n   the bladder; the fundus of the eye.'),
(31074, 'Funeral', 'n.', 'The solemn rites used in the disposition of a dead human\n   body, whether such disposition be by interment, burning, or otherwise;\n   esp., the ceremony or solemnization of interment; obsequies; burial; --\n   formerly used in the plural.'),
(31075, 'Funeral', 'n.', 'The procession attending the burial of the dead; the show\n   and accompaniments of an interment.'),
(31076, 'Funeral', 'n.', 'A funeral sermon; -- usually in the plural.'),
(31077, 'Funeral', 'n.', 'Per. taining to a funeral; used at the interment of the\n   dead; as, funeral rites, honors, or ceremonies.'),
(31078, 'Funerate', 'v. t.', 'To bury with funeral rites.'),
(31079, 'Funereal', 'a.', 'Suiting a funeral; pertaining to burial; solemn. Hence:\n   Dark; dismal; mournful.'),
(31080, 'Funest', 'a.', 'Lamentable; doleful.'),
(31081, 'Fungal', 'a.', 'Of or pertaining to fungi.'),
(31082, 'Fungate', 'n.', 'A salt of fungic acid.'),
(31083, 'Funge', 'n.', 'A blockhead; a dolt; a fool.'),
(31084, 'Fungi', 'n. pl.', 'See Fungus.'),
(31085, 'Fungia', 'n.', 'A genus of simple, stony corals; -- so called because they\n   are usually flat and circular, with radiating plates, like the gills of\n   a mushroom. Some of them are eighteen inches in diameter.'),
(31086, 'Fungian', 'a.', 'Of or pertaining to the Fungidae, a family of stony\n   corals.'),
(31087, 'Fungian', 'n.', 'One of the Fungidae.'),
(31088, 'Fungic', 'a.', 'Pertaining to, or obtained from, mushrooms; as, fungic\n   acid.'),
(31089, 'Fungin', 'n.', 'A name formerly given to cellulose found in certain fungi\n   and mushrooms.'),
(31090, 'Fungite', 'n.', 'A fossil coral resembling Fungia.'),
(31091, 'Fungoid', 'a.', 'Like a fungus; fungous; spongy.'),
(31092, 'Fungous', 'a.', 'Of the nature of fungi; spongy.'),
(31093, 'Fungous', 'a.', 'Growing suddenly, but not substantial or durable.'),
(31094, 'Fungi', 'pl. ', 'of Fungus'),
(31095, 'Funguses', 'pl. ', 'of Fungus'),
(31096, 'Fungus', 'n.', 'Any one of the Fungi, a large and very complex group of\n   thallophytes of low organization, -- the molds, mildews, rusts, smuts,\n   mushrooms, toadstools, puff balls, and the allies of each.'),
(31097, 'Fungus', 'n.', 'A spongy, morbid growth or granulation in animal bodies, as\n   the proud flesh of wounds.'),
(31098, 'Funic', 'a.', 'Funicular.'),
(31099, 'Funicle', 'n.', 'A small cord, ligature, or fiber.'),
(31100, 'Funicle', 'n.', 'The little stalk that attaches a seed to the placenta.'),
(31101, 'Funiculi', 'pl. ', 'of Funiculus'),
(31102, 'Funis', 'n.', 'A cord; specifically, the umbilical cord or navel string.'),
(31103, 'Funking', 'n.', 'A shrinking back through fear.'),
(31104, 'Funky', 'a.', 'Pertaining to, or characterized by, great fear, or funking.'),
(31105, 'Funnel', 'v. t.', 'A vessel of the shape of an inverted hollow cone,\n   terminating below in a pipe, and used for conveying liquids into a\n   close vessel; a tunnel.'),
(31106, 'Funnel', 'v. t.', 'A passage or avenue for a fluid or flowing substance;\n   specifically, a smoke flue or pipe; the iron chimney of a steamship or\n   the like.'),
(31107, 'Funny', 'superl.', 'Droll; comical; amusing; laughable.'),
