(31346, 'Galactin', 'n.', 'An amorphous, gelatinous substance containing nitrogen,\n   found in milk and other animal fluids. It resembles peptone, and is\n   variously regarded as a coagulating or emulsifying agent.'),
(31347, 'Galactin', 'n.', 'A white waxy substance found in the sap of the South\n   American cow tree (Galactodendron).'),
(31348, 'Galactin', 'n.', 'An amorphous, gummy carbohydrate resembling gelose, found\n   in the seeds of leguminous plants, and yielding on decomposition\n   several sugars, including galactose.'),
(31349, 'Galage', 'n.', 'See Galoche.'),
(31350, 'Galagos', 'pl. ', 'of Galago'),
(31351, 'Galago', 'n.', 'A genus of African lemurs, including numerous species.'),
(31352, 'Galanga', 'n.', 'Alt. of Galangal'),
(31353, 'Galangal', 'n.', 'The pungent aromatic rhizome or tuber of certain East\n   Indian or Chinese species of Alpinia (A. Galanga and A. officinarum)\n   and of the Kaempferia Galanga), -- all of the Ginger family.'),
(31354, 'Galatian', 'a.', 'Of or pertaining to Galatia or its inhabitants. -- A\n   native or inhabitant of Galatia, in Asia Minor; a descendant of the\n   Gauls who settled in Asia Minor.'),
(31355, 'Galaxies', 'pl. ', 'of Galaxy'),
(31356, 'Galaxy', 'n.', 'The Milky Way; that luminous tract, or belt, which is seen\n   at night stretching across the heavens, and which is composed of\n   innumerable stars, so distant and blended as to be distinguishable only\n   with the telescope. The term has recently been used for remote clusters\n   of stars.'),
(31357, 'Galaxy', 'n.', 'A splendid assemblage of persons or things.'),
(31358, 'Galban', 'n.', 'Alt. of Galbanum'),
(31359, 'Galbanum', 'n.', 'A gum resin exuding from the stems of certain Asiatic\n   umbelliferous plants, mostly species of Ferula. The Bubon Galbanum of\n   South Africa furnishes an inferior kind of galbanum. It has an acrid,\n   bitter taste, a strong, unpleasant smell, and is used for medical\n   purposes, also in the arts, as in the manufacture of varnish.'),
(31360, 'Galea', 'n.', 'The upper lip or helmet-shaped part of a labiate flower.'),
(31361, 'Galea', 'n.', 'A kind of bandage for the head.'),
(31362, 'Galea', 'n.', 'Headache extending all over the head.'),
(31363, 'Galea', 'n.', 'A genus of fossil echini, having a vaulted, helmet-shaped\n   shell.'),
(31364, 'Galea', 'n.', 'The anterior, outer process of the second joint of the\n   maxillae in certain insects.'),
(31365, 'Galeas', 'n.', 'See Galleass.'),
(31366, 'Galeate', 'a.', 'Alt. of Galeated'),
(31367, 'Galeated', 'a.', 'Wearing a helmet; protected by a helmet; covered, as with\n   a helmet.'),
(31368, 'Galeated', 'a.', 'Helmeted; having a helmetlike part, as a crest, a flower,\n   etc.; helmet-shaped.'),
(31369, 'Galei', 'n. pl.', 'That division of elasmobranch fishes which includes the\n   sharks.'),
(31370, 'Galena', 'n.', 'A remedy or antidose for poison; theriaca.'),
(31371, 'Galena', 'n.', 'Lead sulphide; the principal ore of lead. It is of a bluish\n   gray color and metallic luster, and is cubic in crystallization and\n   cleavage.'),
(31372, 'Galenic', 'a.', 'Alt. of Galenical'),
(31373, 'Galenic', 'an.', 'Alt. of Galenical'),
(31374, 'Galenism', 'n.', 'The doctrines of Galen.'),
(31375, 'Galenist', 'n.', 'A follower of Galen.'),
(31376, 'Galenite', 'n.', 'Galena; lead ore.'),
(31377, 'Galerite', 'n.', 'A cretaceous fossil sea urchin of the genus Galerites.'),
(31378, 'Galician', 'a.', 'Of or pertaining to Galicia, in Spain, or to Galicia, the\n   kingdom of Austrian Poland.'),
(31379, 'Galician', 'n.', 'A native of Galicia in Spain; -- called also Gallegan.'),
(31380, 'Galilean', 'a.', 'Of or pertaining to Galileo; as, the Galilean telescope.\n   See Telescope.'),
(31381, 'Galilean', 'a.', 'Of or relating to Galilee.'),
(31382, 'Galilean', 'n.', 'A native or inhabitant of Galilee, the northern province\n   of Palestine under the Romans.'),
(31383, 'Galilean', 'n.', 'One of the party among the Jews, who opposed the payment\n   of tribute to the Romans; -- called also Gaulonite.'),
(31384, 'Galilean', 'n.', 'A Christian in general; -- used as a term of reproach by\n   Mohammedans and Pagans.'),
(31385, 'Galilee', 'n.', 'A porch or waiting room, usually at the west end of an\n   abbey church, where the monks collected on returning from processions,\n   where bodies were laid previous to interment, and where women were\n   allowed to see the monks to whom they were related, or to hear divine\n   service. Also, frequently applied to the porch of a church, as at Ely\n   and Durham cathedrals.'),
(31386, 'Galiot', 'n.', 'A small galley, formerly used in the Mediterranean, built\n   mainly for speed. It was moved both by sails and oars, having one mast,\n   and sixteen or twenty seats for rowers.'),
(31387, 'Galiot', 'n.', 'A strong, light-draft, Dutch merchant vessel, carrying a\n   mainmast and a mizzenmast, and a large gaff mainsail.'),
(31388, 'Galipot', 'n.', 'An impure resin of turpentine, hardened on the outside of\n   pine trees by the spontaneous evaporation of its essential oil. When\n   purified, it is called yellow pitch, white pitch, or Burgundy pitch.'),
(31389, 'Galled', 'imp. & p. p.', 'of Gall'),
(31390, 'Galling', 'p. pr. & vb. n.', 'of Gall'),
(31391, 'Gallant', 'a.', 'Showy; splendid; magnificent; gay; well-dressed.'),
(31392, 'Gallant', 'a.', 'Noble in bearing or spirit; brave; high-spirited;\n   courageous; heroic; magnanimous; as, a gallant youth; a gallant\n   officer.'),
(31393, 'Gallant', 'a.', 'Polite and attentive to ladies; courteous to women;\n   chivalrous.'),
(31394, 'Gallant', 'n.', 'A man of mettle or spirit; a gay; fashionable man; a young\n   blood.'),
(31395, 'Gallant', 'n.', 'One fond of paying attention to ladies.'),
(31396, 'Gallant', 'n.', 'One who wooes; a lover; a suitor; in a bad sense, a\n   seducer.'),
(31397, 'Gallant', 'v. t.', 'To attend or wait on, as a lady; as, to gallant ladies\n   to the play.'),
(31398, 'Gallant', 'v. t.', 'To handle with grace or in a modish manner; as, to\n   gallant a fan.'),
(31399, 'Gallate', 'n.', 'A salt of gallic acid.'),
(31400, 'Galleass', 'n.', 'A large galley, having some features of the galleon, as\n   broadside guns; esp., such a vessel used by the southern nations of\n   Europe in the 16th and 17th centuries. See Galleon, and Galley.'),
(31401, 'Gallegan', 'n.', 'Alt. of Gallego'),
(31402, 'Gallego', 'n.', 'A native or inhabitant of Galicia, in Spain; a Galician.'),
(31403, 'Gallein', 'n.', 'A red crystalline dyestuff, obtained by heating together\n   pyrogallic and phthalic acids.'),
(31404, 'Galleon', 'n.', 'A sailing vessel of the 15th and following centuries,\n   often having three or four decks, and used for war or commerce. The\n   term is often rather indiscriminately applied to any large sailing\n   vessel.'),
(31405, 'Galleot', 'n.', 'See Galiot.'),
(31406, 'Gallery', 'a.', 'A long and narrow corridor, or place for walking; a\n   connecting passageway, as between one room and another; also, a long\n   hole or passage excavated by a boring or burrowing animal.'),
(31407, 'Gallery', 'a.', 'A room for the exhibition of works of art; as, a picture\n   gallery; hence, also, a large or important collection of paintings,\n   sculptures, etc.'),
(31408, 'Gallery', 'a.', 'A long and narrow platform attached to one or more sides\n   of public hall or the interior of a church, and supported by brackets\n   or columns; -- sometimes intended to be occupied by musicians or\n   spectators, sometimes designed merely to increase the capacity of the\n   hall.'),
(31409, 'Gallery', 'a.', 'A frame, like a balcony, projecting from the stern or\n   quarter of a ship, and hence called stern gallery or quarter gallery,\n   -- seldom found in vessels built since 1850.'),
(31410, 'Gallery', 'a.', 'Any communication which is covered overhead as well as at\n   the sides. When prepared for defense, it is a defensive gallery.'),
(31411, 'Gallery', 'a.', 'A working drift or level.'),
(31412, 'Galleys', 'pl. ', 'of Galley'),
(31413, 'Galley', 'n.', 'A vessel propelled by oars, whether having masts and sails\n   or not'),
(31414, 'Galley', 'n.', 'A large vessel for war and national purposes; -- common in\n   the Middle Ages, and down to the 17th century.'),
(31415, 'Galley', 'n.', 'A name given by analogy to the Greek, Roman, and other\n   ancient vessels propelled by oars.'),
(31416, 'Galley', 'n.', 'A light, open boat used on the Thames by customhouse\n   officers, press gangs, and also for pleasure.'),
(31417, 'Galley', 'n.', 'One of the small boats carried by a man-of-war.'),
(31418, 'Galley', 'n.', 'The cookroom or kitchen and cooking apparatus of a vessel;\n   -- sometimes on merchant vessels called the caboose.'),
(31419, 'Galley', 'n.', 'An oblong oven or muffle with a battery of retorts; a\n   gallery furnace.'),
(31420, 'Galley', 'n.', 'An oblong tray of wood or brass, with upright sides, for\n   holding type which has been set, or is to be made up, etc.'),
(31421, 'Galley', 'n.', 'A proof sheet taken from type while on a galley; a galley\n   proof.'),
(31422, 'Gallfly', 'n.', 'An insect that deposits its eggs in plants, and occasions\n   galls, esp. any small hymenopteran of the genus Cynips and allied\n   genera. See Illust. of Gall.'),
(31423, 'Gallian', 'a.', 'Gallic; French.'),
(31424, 'Galliard', 'a.', 'Gay; brisk; active.'),
(31425, 'Galliard', 'n.', 'A brisk, gay man.'),
(31426, 'Galliard', 'a.', 'A gay, lively dance. Cf. Gailliarde.'),
(31427, 'Galliass', 'n.', 'Same as Galleass.'),
(31428, 'Gallic', 'a.', 'Pertaining to, or containing, gallium.'),
(31429, 'Gallic', 'a.', 'Pertaining to, or derived from, galls, nutgalls, and the\n   like.'),
(31430, 'Gallic', 'a.', 'Pertaining to Gaul or France; Gallican.'),
(31431, 'Gallican', 'a.', 'Of or pertaining to Gaul or France; Gallic; French; as,\n   the Gallican church or clergy.'),
(31432, 'Gallican', 'n.', 'An adherent to, and supporter of, Gallicanism.'),
(31433, 'Gallied', 'p. p. & a.', 'Worried; flurried; frightened.'),
(31434, 'Gallin', 'n.', 'A substance obtained by the reduction of gallein.'),
(31435, 'Gallinae', 'n.', 'An order of birds, including the common domestic fowls,\n   pheasants, grouse, quails, and allied forms; -- sometimes called\n   Rasores.'),
(31436, 'Galling', 'a.', 'Fitted to gall or chafe; vexing; harassing; irritating.'),
(31437, 'Galliot', 'n.', 'See Galiot.'),
(31438, 'Gallipot', 'n.', 'A glazed earthen pot or vessel, used by druggists and\n   apothecaries for containing medicines, etc.'),
(31439, 'Gallium', 'n.', 'A rare metallic element, found in certain zinc ores. It is\n   white, hard, and malleable, resembling aluminium, and remarcable for\n   its low melting point (86/ F., 30/C). Symbol Ga. Atomic weight 69.9.'),
(31440, 'Gallivat', 'n.', 'A small armed vessel, with sails and oars, -- used on the\n   Malabar coast.'),
(31441, 'Gallnut', 'n.', 'A round gall produced on the leaves and shoots of various\n   species of the oak tree. See Gall, and Nutgall.'),
(31442, 'Gallon', 'n.', 'A measure of capacity, containing four quarts; -- used, for\n   the most part, in liquid measure, but sometimes in dry measure.'),
(31443, 'Galloon', 'n.', 'A narrow tapelike fabric used for binding hats, shoes,\n   etc., -- sometimes made ornamental.'),
(31444, 'Galloon', 'n.', 'A similar bordering or binding of rich material, such as\n   gold lace.'),
(31445, 'Galloped', 'imp. & p. p.', 'of Gallop'),
(31446, 'Gallop', 'v. i.', 'To move or run in the mode called a gallop; as a horse;\n   to go at a gallop; to run or move with speed.'),
(31447, 'Gallop', 'v. i.', 'To ride a horse at a gallop.'),
(31448, 'Gallop', 'v. i.', 'Fig.: To go rapidly or carelessly, as in making a hasty\n   examination.'),
(31449, 'Gallop', 'v. t.', 'To cause to gallop.'),
(31450, 'Gallop', 'v. i.', 'A mode of running by a quadruped, particularly by a\n   horse, by lifting alternately the fore feet and the hind feet, in\n   successive leaps or bounds.'),
(31451, 'Galloper', 'n.', 'One who, or that which, gallops.'),
(31452, 'Galloper', 'n.', 'A carriage on which very small guns were formerly\n   mounted, the gun resting on the shafts, without a limber.'),
(31453, 'Gallopin', 'v. i.', 'An under servant for the kitchen; a scullion; a cook\'s\n   errand boy.'),
(31454, 'Gallow', 'v. t.', 'To fright or terrify. See Gally, v. t.'),
(31455, 'Galloway', 'n.', 'A small horse of a breed raised at Galloway, Scotland; --\n   called also garran, and garron.'),
(31456, 'Gallows', 'pl. ', 'of Gallows');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(31457, 'Gallows', 'n. sing.', 'A frame from which is suspended the rope with which\n   criminals are executed by hanging, usually consisting of two upright\n   posts and a crossbeam on the top; also, a like frame for suspending\n   anything.'),
(31458, 'Gallows', 'n. sing.', 'A wretch who deserves the gallows.'),
(31459, 'Gallows', 'n. sing.', 'The rest for the tympan when raised.'),
(31460, 'Gallows', 'n. sing.', 'A pair of suspenders or braces.'),
(31461, 'Gally', 'v. t.', 'To frighten; to worry.'),
(31462, 'Gally', 'a.', 'Like gall; bitter as gall.'),
(31463, 'Gally', 'n.', 'See Galley, n., 4.'),
(31464, 'Galoche', '', 'Alt. of Galoshe'),
(31465, 'Galoshe', '', 'A clog or patten.'),
(31466, 'Galoshe', '', 'Hence: An overshoe worn in wet weather.'),
(31467, 'Galoshe', '', 'A gaiter, or legging, covering the upper part of the shoe\n   and part of the leg.'),
(31468, 'Galoot', 'n.', 'A noisy, swaggering, or worthless fellow; a rowdy.'),
(31469, 'Galop', 'n.', 'A kind of lively dance, in 2-4 time; also, the music to the\n   dance.'),
(31470, 'Galore', 'n. & a.', 'Plenty; abundance; in abundance.'),
(31471, 'Galoshe', 'n.', 'Same as Galoche.'),
(31472, 'Galpe', 'v. i.', 'To gape,; to yawn.'),
(31473, 'Galsome', 'a.', 'Angry; malignant.'),
(31474, 'Galvanic', 'a.', 'Of or pertaining to, or exhibiting the phenomena of,\n   galvanism; employing or producing electrical currents.'),
(31475, 'Galwes', 'n.', 'Gallows.'),
(31476, 'Gamashes', 'n. pl.', 'High boots or buskins; in Scotland, short\n   spatterdashes or riding trousers, worn over the other clothing.'),
(31477, 'Gamba', 'n.', 'A viola da gamba.'),
(31478, 'Gambeson', 'n.', 'Same as Gambison.'),
(31479, 'Gambet', 'n.', 'Any bird of the genuis Totanus. See Tattler.'),
(31480, 'Gambier', 'n.', 'The inspissated juice of a plant (Uncaria Gambir) growing\n   in Malacca. It is a powerful astringent, and, under the name of Terra\n   Japonica, is used for chewing with the Areca nut, and is exported for\n   tanning and dyeing.'),
(31481, 'Gambier', 'n.', 'Catechu.'),
(31482, 'Gambison', 'n.', 'A defensive garment formerly in use for the body, made of\n   cloth stuffed and quilted.'),
(31483, 'Gambist', 'n.', 'A performer upon the viola di gamba. See under Viola.'),
(31484, 'Gambit', 'n.', 'A mode of opening the game, in which a pawn is sacrificed\n   to gain an attacking position.'),
(31485, 'Gambled', 'imp. & p. p.', 'of Gamble'),
(31486, 'Gambling', 'p. pr. & vb. n.', 'of Gamble'),
(31487, 'Gamble', 'v. i.', 'To play or game for money or other stake.'),
(31488, 'Gamble', 'v. t.', 'To lose or squander by gaming; -- usually with away.'),
(31489, 'Gambler', 'n.', 'One who gambles.'),
(31490, 'Gamboge', 'n.', 'A concrete juice, or gum resin, produced by several\n   species of trees in Siam, Ceylon, and Malabar. It is brought in masses,\n   or cylindrical rolls, from Cambodia, or Cambogia, -- whence its name.\n   The best kind is of a dense, compact texture, and of a beatiful reddish\n   yellow. Taking internally, it is a strong and harsh cathartic and\n   emetic.'),
(31491, 'Gambogic', 'a.', 'Pertaining to, resembling, or containing, gamboge.'),
(31492, 'Gambol', 'n.', 'A skipping or leaping about in frolic; a hop; a sportive\n   prank.'),
(31493, 'Gamboled', 'imp. & p. p.', 'of Gambol'),
(31494, 'Gambol', 'v. i.', 'To dance and skip about in sport; to frisk; to skip; to\n   play in frolic, like boys or lambs.'),
(31495, 'Gambrel', 'n.', 'The hind leg of a horse.'),
(31496, 'Gambrel', 'n.', 'A stick crooked like a horse\'s hind leg; -- used by\n   butchers in suspending slaughtered animals.'),
(31497, 'Gambrel', 'v. t.', 'To truss or hang up by means of a gambrel.'),
(31498, 'Gambroon', 'n.', 'A kind of twilled linen cloth for lining.'),
(31499, 'Gamed', 'imp. & p. p.', 'of Game'),
(31500, 'Gaming', 'p. pr. & vb. n.', 'of Game'),
(31501, 'Gamecock', 'n.', 'The male game fowl.'),
(31502, 'Gameful', 'a.', 'Full of game or games.'),
(31503, 'Gameless', 'a.', 'Destitute of game.'),
(31504, 'Gamely', 'adv.', 'In a plucky manner; spiritedly.'),
(31505, 'Gameness', 'n.', 'Endurance; pluck.'),
(31506, 'Gamesome', 'a.', 'Gay; sportive; playful; frolicsome; merry.'),
(31507, 'Gamester', 'n.', 'A merry, frolicsome person.'),
(31508, 'Gamester', 'n.', 'A person who plays at games; esp., one accustomed to play\n   for a stake; a gambler; one skilled in games.'),
(31509, 'Gamester', 'n.', 'A prostitute; a strumpet.'),
(31510, 'Gamic', 'a.', 'Pertaining to, or resulting from, sexual connection; formed\n   by the union of the male and female elements.'),
(31511, 'Gamin', 'n.', 'A neglected and untrained city boy; a young street Arab.'),
(31512, 'Gaming', 'n.', 'The act or practice of playing games for stakes or wagers;\n   gambling.'),
(31513, 'Gamma', 'n.', 'The third letter (/, / = Eng. G) of the Greek alphabet.'),
(31514, 'Gammer', 'n.', 'An old wife; an old woman; -- correlative of gaffer, an old\n   man.'),
(31515, 'Gammon', 'n.', 'The buttock or thigh of a hog, salted and smoked or dried;\n   the lower end of a flitch.'),
(31516, 'Gammoned', 'imp. & p. p.', 'of Gammon'),
(31517, 'Gammon', 'v. t.', 'To make bacon of; to salt and dry in smoke.'),
(31518, 'Gammon', 'n.', 'Backgammon.'),
(31519, 'Gammon', 'n.', 'An imposition or hoax; humbug.'),
(31520, 'Gammon', 'v. t.', 'To beat in the game of backgammon, before an antagonist\n   has been able to get his \"men\" or counters home and withdraw any of\n   them from the board; as, to gammon a person.'),
(31521, 'Gammon', 'v. t.', 'To impose on; to hoax; to cajole.'),
(31522, 'Gammon', 'v. t.', 'To fasten (a bowsprit) to the stem of a vessel by\n   lashings of rope or chain, or by a band of iron.'),
(31523, 'Gamut', 'n.', 'The scale.'),
(31524, 'Ganch', 'n.', 'To drop from a high place upon sharp stakes or hooks, as the\n   Turks dropped malefactors, by way of punishment.'),
(31525, 'Gander', 'n.', 'The male of any species of goose.'),
(31526, 'Ganesa', 'n.', 'The Hindoo god of wisdom or prudence.'),
(31527, 'Ganger', 'n.', 'One who oversees a gang of workmen.'),
(31528, 'Gangetic', 'a.', 'Pertaining to, or inhabiting, the Ganges; as, the\n   Gangetic shark.'),
(31529, 'Gangion', 'n.', 'A short line attached to a trawl. See Trawl, n.'),
(31530, 'Gangliac', 'a.', 'Alt. of Ganglial'),
(31531, 'Ganglial', 'a.', 'Relating to a ganglion; ganglionic.'),
(31532, 'Ganglia', 'pl. ', 'of Ganglion'),
(31533, 'Ganglion', 'n.', 'A mass or knot of nervous matter, including nerve cells,\n   usually forming an enlargement in the course of a nerve.'),
(31534, 'Ganglion', 'n.', 'A node, or gland in the lymphatic system; as, a lymphatic\n   ganglion.'),
(31535, 'Ganglion', 'n.', 'A globular, hard, indolent tumor, situated somewhere on a\n   tendon, and commonly formed by the effusion of a viscid fluid into it;\n   -- called also weeping sinew.'),
(31536, 'Gangrel', 'v. i.', 'Wandering; vagrant.'),
(31537, 'Gangrene', 'n.', 'A term formerly restricted to mortification of the soft\n   tissues which has not advanced so far as to produce complete loss of\n   vitality; but now applied to mortification of the soft parts in any\n   stage.'),
(31538, 'Gangrene', 'v. t. & i.', 'To produce gangrene in; to be affected with\n   gangrene.'),
(31539, 'Gangue', 'n.', 'The mineral or earthy substance associated with metallic\n   ore.'),
(31540, 'Gangway', 'v. i.', 'A passage or way into or out of any inclosed place;\n   esp., a temporary way of access formed of planks.'),
(31541, 'Gangway', 'v. i.', 'In the English House of Commons, a narrow aisle across\n   the house, below which sit those who do not vote steadly either with\n   the government or with the opposition.'),
(31542, 'Gangway', 'v. i.', 'The opening through the bulwarks of a vessel by which\n   persons enter or leave it.'),
(31543, 'Gangway', 'v. i.', 'That part of the spar deck of a vessel on each side of\n   the booms, from the quarter-deck to the forecastle; -- more properly\n   termed the waist.'),
(31544, 'Ganil', 'n.', 'A kind of brittle limestone.'),
(31545, 'Ganister', 'n.', 'Alt. of Gannister'),
(31546, 'Ganja', 'n.', 'The dried hemp plant, used in India for smoking. It is\n   extremely narcotic and intoxicating.'),
(31547, 'Gannet', 'n.', 'One of several species of sea birds of the genus Sula,\n   allied to the pelicans.'),
(31548, 'Ganoid', 'a.', 'Of or pertaining to Ganoidei. -- n. One of the Ganoidei.'),
(31549, 'Ganoidal', 'a.', 'Ganoid.'),
(31550, 'Ganoidei', 'n. pl.', 'One of the subclasses of fishes. They have an\n   arterial cone and bulb, spiral intestinal valve, and the optic nerves\n   united by a chiasma. Many of the species are covered with bony plates,\n   or with ganoid scales; others have cycloid scales.'),
(31551, 'Ganoine', 'n.', 'A peculiar bony tissue beneath the enamel of a ganoid\n   scale.'),
(31552, 'Gansa', 'n.', 'Same as Ganza.'),
(31553, 'Gantlet', 'n.', 'A military punishment formerly in use, wherein the\n   offender was made to run between two files of men facing one another,\n   who struck him as he passed.'),
(31554, 'Gantlet', 'n.', 'A glove. See Gauntlet.'),
(31555, 'Gantline', 'n.', 'A line rigged to a mast; -- used in hoisting rigging; a\n   girtline.'),
(31556, 'Gantlope', 'n.', 'See Gantlet.'),
(31557, 'Gantry', 'n.', 'See Gauntree.'),
(31558, 'Ganza', 'n.', 'A kind of wild goose, by a flock of which a virtuoso was\n   fabled to be carried to the lunar world.'),
(31559, 'Gaoler', 'n.', 'The keeper of a jail. See Jailer.'),
(31560, 'Gaped', 'imp. & p. p.', 'of Gape'),
(31561, 'Gaping', 'p. pr. & vb. n.', 'of Gape'),
(31562, 'Gaper', 'n.', 'One who gapes.'),
(31563, 'Gaper', 'n.', 'A European fish. See 4th Comber.'),
(31564, 'Gaper', 'n.', 'A large edible clam (Schizothaerus Nuttalli), of the Pacific\n   coast; -- called also gaper clam.'),
(31565, 'Gaper', 'n.', 'An East Indian bird of the genus Cymbirhynchus, related to\n   the broadbills.'),
(31566, 'Gapeseed', 'n.', 'Any strange sight.'),
(31567, 'Gapesing', 'n.', 'Act of gazing about; sightseeing.'),
(31568, 'Gapeworm', 'n.', 'The parasitic worm that causes the gapes in birds. See\n   Illustration in Appendix.'),
(31569, 'Garancin', 'n.', 'An extract of madder by sulphuric acid. It consists\n   essentially of alizarin.'),
(31570, 'Garbage', 'n.', 'Offal, as the bowels of an animal or fish; refuse animal\n   or vegetable matter from a kitchen; hence, anything worthless,\n   disgusting, or loathsome.'),
(31571, 'Garbage', 'v. t.', 'To strip of the bowels; to clean.'),
(31572, 'Garbed', 'a.', 'Dressed; habited; clad.'),
(31573, 'Garbel', 'n.', 'Same as Garboard.'),
(31574, 'Garbel', 'v. t.', 'Anything sifted, or from which the coarse parts have\n   been taken.'),
(31575, 'Garbled', 'imp. & p. p.', 'of Garble'),
(31576, 'Garbling', 'p. pr. & vb. n.', 'of Garble'),
