(31807, 'Gayal', 'n.', 'A Southern Asiatic species of wild cattle (Bibos frontalis).'),
(31808, 'Gaydiang', 'n.', 'A vessel of Anam, with two or three masts, lofty\n   triangular sails, and in construction somewhat resembling a Chinese\n   junk.'),
(31809, 'Gayeties', 'pl. ', 'of Gayety'),
(31810, 'Gayety', 'a.', 'The state of being gay; merriment; mirth; acts or\n   entertainments prompted by, or inspiring, merry delight; -- used often\n   in the plural; as, the gayeties of the season.'),
(31811, 'Gayety', 'a.', 'Finery; show; as, the gayety of dress.'),
(31812, 'Gayly', 'adv.', 'With mirth and frolic; merrily; blithely; gleefully.'),
(31813, 'Gayly', 'adv.', 'Finely; splendidly; showily; as, ladies gayly dressed; a\n   flower gayly blooming.'),
(31814, 'Gayne', 'v. i.', 'To avail.'),
(31815, 'Gayness', 'n.', 'Gayety; finery.'),
(31816, 'Gaysome', 'a.', 'Full of gayety. Mir. for Mag.'),
(31817, 'Gaytre', 'n.', 'The dogwood tree.'),
(31818, 'Gazed', 'imp. & p. p.', 'of Gaze'),
(31819, 'Gazing', 'p. pr. & vb. n.', 'of Gaze'),
(31820, 'Gazeebo', 'n.', 'A summerhouse so situated as to command an extensive\n   prospect.'),
(31821, 'Gazeful', 'a.', 'Gazing.'),
(31822, 'Gazel', 'n.', 'The black currant; also, the wild plum.'),
(31823, 'Gazel', 'n.', 'See Gazelle.'),
(31824, 'Gazelle', 'n.', 'One of several small, swift, elegantly formed species of\n   antelope, of the genus Gazella, esp. G. dorcas; -- called also algazel,\n   corinne, korin, and kevel. The gazelles are celebrated for the luster\n   and soft expression of their eyes.'),
(31825, 'Gazement', 'n.', 'View.'),
(31826, 'Gazer', 'n.', 'One who gazes.'),
(31827, 'Gazet', 'n.', 'A Venetian coin, worth about three English farthings, or one\n   and a half cents.'),
(31828, 'Gazette', 'n.', 'A newspaper; a printed sheet published periodically; esp.,\n   the official journal published by the British government, and\n   containing legal and state notices.'),
(31829, 'Gazetted', 'imp. & p. p.', 'of Gazette'),
(31830, 'Gazette', 'v. t.', 'To announce or publish in a gazette; to announce\n   officially, as an appointment, or a case of bankruptcy.'),
(31831, 'Gazogene', 'n.', 'A portable apparatus for making soda water or aerated\n   liquids on a small scale.'),
(31832, 'Gazon', 'n.', 'One of the pieces of sod used to line or cover parapets and\n   the faces of earthworks.'),
(31833, 'Geared', 'imp. & p. p.', 'of Gear'),
(31834, 'Gearing', 'p. pr. & vb. n.', 'of Gear'),
(31835, 'Gearing', 'n.', 'Harness.'),
(31836, 'Gearing', 'n.', 'The parts by which motion imparted to one portion of an\n   engine or machine is transmitted to another, considered collectively;\n   as, the valve gearing of locomotive engine; belt gearing; esp., a train\n   of wheels for transmitting and varying motion in machinery.'),
(31837, 'Geason', 'a.', 'Rare; wonderful.'),
(31838, 'Geckoes', 'pl. ', 'of Gecko'),
(31839, 'Gecko', 'n.', 'Any lizard of the family Geckonidae. The geckoes are small,\n   carnivorous, mostly nocturnal animals with large eyes and vertical,\n   elliptical pupils. Their toes are generally expanded, and furnished\n   with adhesive disks, by which they can run over walls and ceilings.\n   They are numerous in warm countries, and a few species are found in\n   Europe and the United States. See Wall gecko, Fanfoot.'),
(31840, 'Geeing', 'p. pr. & vb. n.', 'of Gee'),
(31841, 'Geering', '', 'See Gear, Gearing.'),
(31842, 'Geese', 'n.', 'pl. of Goose.'),
(31843, 'Geest', 'n.', 'Alluvial matter on the surface of land, not of recent\n   origin.'),
(31844, 'Gehenna', 'n.', 'The valley of Hinnom, near Jerusalem, where some of the\n   Israelites sacrificed their children to Moloch, which, on this account,\n   was afterward regarded as a place of abomination, and made a receptacle\n   for all the refuse of the city, perpetual fires being kept up in order\n   to prevent pestilential effluvia. In the New Testament the name is\n   transferred, by an easy metaphor, to Hell.'),
(31845, 'Gelable', 'a.', 'Capable of being congealed; capable of being converted\n   into jelly.'),
(31846, 'Gelada', 'n.', 'A baboon (Gelada Ruppelli) of Abyssinia, remarkable for the\n   length of the hair on the neck and shoulders of the adult male.'),
(31847, 'Gelastic', 'a.', 'Pertaining to laughter; used in laughing.'),
(31848, 'Gelatin', 'n.', 'Alt. of Gelatine'),
(31849, 'Gelatine', 'n.', 'Animal jelly; glutinous material obtained from animal\n   tissues by prolonged boiling. Specifically (Physiol. Chem.), a\n   nitrogeneous colloid, not existing as such in the animal body, but\n   formed by the hydrating action of boiling water on the collagen of\n   various kinds of connective tissue (as tendons, bones, ligaments,\n   etc.). Its distinguishing character is that of dissolving in hot water,\n   and forming a jelly on cooling. It is an important ingredient of\n   calf\'s-foot jelly, isinglass, glue, etc. It is used as food, but its\n   nutritious qualities are of a low order.'),
(31850, 'Gelatine', 'n.', 'Same as Gelatin.'),
(31851, 'Gelation', 'n.', 'The process of becoming solid by cooling; a cooling and\n   solidifying.'),
(31852, 'Gelded', 'imp. & p. p.', 'of Geld'),
(31853, 'Gelding', 'p. pr. & vb. n.', 'of Geld'),
(31854, 'Geldable', 'a.', 'Capable of being gelded.'),
(31855, 'Geldable', 'a.', 'Liable to taxation.'),
(31856, 'Gelder', 'n.', 'One who gelds or castrates.'),
(31857, 'Gelding', 'v. t.', 'A castrated animal; -- usually applied to a horse, but\n   formerly used also of the human male.'),
(31858, 'Gelding', 'p. pr. a. & vb. n.', 'from Geld, v. t.'),
(31859, 'Gelid', 'a.', 'Cold; very cold; frozen.'),
(31860, 'Gelidity', 'n.', 'The state of being gelid.'),
(31861, 'Gelidly', 'adv.', 'In a gelid manner; coldly.'),
(31862, 'Gelly', 'n.', 'Jelly.'),
(31863, 'Gelose', 'n.', 'An amorphous, gummy carbohydrate, found in Gelidium,\n   agar-agar, and other seaweeds.'),
(31864, 'Gelsemic', 'a.', 'Gelseminic.'),
(31865, 'Gemmed', 'imp. & p. p.', 'of Gem'),
(31866, 'Gemming', 'p. pr. & vb. n.', 'of Gem'),
(31867, 'Gemara', 'n.', 'The second part of the Talmud, or the commentary on the\n   Mishna (which forms the first part or text).'),
(31868, 'Gemaric', 'a.', 'Pertaining to the Gemara.'),
(31869, 'Gemarist', 'n.', 'One versed in the Gemara, or adhering to its teachings.'),
(31870, 'Gemel', 'a.', 'Coupled; paired.'),
(31871, 'Gemel', 'n.', 'One of the twins.'),
(31872, 'Gemel', 'n.', 'One of the barrulets placed parallel and closed to each\n   other. Cf. Bars gemel, under Gemel, a.'),
(31873, 'Geminal', 'a.', 'A pair.'),
(31874, 'Geminate', 'a.', 'In pairs or twains; two together; binate; twin; as,\n   geminate flowers.'),
(31875, 'Geminate', 'v. t.', 'To double.'),
(31876, 'Gemini', 'n. pl.', 'A constellation of the zodiac, containing the two\n   bright stars Castor and Pollux; also, the third sign of the zodiac,\n   which the sun enters about May 20th.'),
(31877, 'Geminous', 'a.', 'Double; in pairs.'),
(31878, 'Geminy', 'n.', 'Twins; a pair; a couple.'),
(31879, 'Gemmae', 'pl. ', 'of Gemma'),
(31880, 'Gemma', 'n.', 'A leaf bud, as distinguished from a flower bud.'),
(31881, 'Gemma', 'n.', 'A bud spore; one of the small spores or buds in the\n   reproduction of certain Protozoa, which separate one at a time from the\n   parent cell.'),
(31882, 'Gemmary', 'a.', 'Of or pertaining to gems.'),
(31883, 'Gemmary', 'n.', 'A receptacle for jewels or gems; a jewel house; jewels or\n   gems, collectively.'),
(31884, 'Gemmate', 'a.', 'Having buds; reproducing by buds.'),
(31885, 'Gemmated', 'a.', 'Having buds; adorned with gems or jewels.'),
(31886, 'Gemmeous', 'a.', 'Pertaining to gems; of the nature of gems; resembling\n   gems.'),
(31887, 'Gemmule', 'n.', 'A little leaf bud, as the plumule between the cotyledons.'),
(31888, 'Gemmule', 'n.', 'One of the buds of mosses.'),
(31889, 'Gemmule', 'n.', 'One of the reproductive spores of algae.'),
(31890, 'Gemmule', 'n.', 'An ovule.'),
(31891, 'Gemmule', 'n.', 'A bud produced in generation by gemmation.'),
(31892, 'Gemmule', 'n.', 'One of the imaginary granules or atoms which, according to\n   Darwin\'s hypothesis of pangenesis, are continually being thrown off\n   from every cell or unit, and circulate freely throughout the system,\n   and when supplied with proper nutriment multiply by self-division and\n   ultimately develop into cells like those from which they were derived.\n   They are supposed to be transmitted from the parent to the offspring,\n   but are often transmitted in a dormant state during many generations\n   and are then developed. See Pangenesis.'),
(31893, 'Gemmy', 'n.', 'Full of gems; bright; glittering like a gem.'),
(31894, 'Gemmy', 'n.', 'Spruce; smart.'),
(31895, 'Gemote', 'v. t.', 'A meeting; -- used in combination, as, Witenagemote, an\n   assembly of the wise men.'),
(31896, 'Gemsbok', 'n.', 'A South African antelope (Oryx Capensis), having long,\n   sharp, nearly straight horns.'),
(31897, 'Gemul', 'n.', 'A small South American deer (Furcifer Chilensis), with\n   simple forked horns.'),
(31898, 'Genappe', 'n.', 'A worsted yarn or cord of peculiar smoothness, used in the\n   manufacture of braid, fringe, etc.'),
(31899, 'Gendarme', 'n.', 'One of a body of heavy cavalry.'),
(31900, 'Gendarme', 'n.', 'An armed policeman in France.'),
(31901, 'Gender', 'n.', 'Kind; sort.'),
(31902, 'Gender', 'n.', 'Sex, male or female.'),
(31903, 'Gender', 'n.', 'A classification of nouns, primarily according to sex; and\n   secondarily according to some fancied or imputed quality associated\n   with sex.'),
(31904, 'Gendered', 'imp. & p. p.', 'of Gender'),
(31905, 'Gender', 'n.', 'To beget; to engender.'),
(31906, 'Gender', 'v. i.', 'To copulate; to breed.'),
(31907, 'Genearch', 'n.', 'The chief of a family or tribe.'),
(31908, 'Genera', 'n. pl.', 'See Genus.'),
(31909, 'General', 'a.', 'Relating to a genus or kind; pertaining to a whole class\n   or order; as, a general law of animal or vegetable economy.'),
(31910, 'General', 'a.', 'Comprehending many species or individuals; not special or\n   particular; including all particulars; as, a general inference or\n   conclusion.'),
(31911, 'General', 'a.', 'Not restrained or limited to a precise import; not\n   specific; vague; indefinite; lax in signification; as, a loose and\n   general expression.'),
(31912, 'General', 'a.', 'Common to many, or the greatest number; widely spread;\n   prevalent; extensive, though not universal; as, a general opinion; a\n   general custom.'),
(31913, 'General', 'a.', 'Having a relation to all; common to the whole; as, Adam,\n   our general sire.'),
(31914, 'General', 'a.', 'As a whole; in gross; for the most part.'),
(31915, 'General', 'a.', 'Usual; common, on most occasions; as, his general habit or\n   method.'),
(31916, 'General', 'a.', 'The whole; the total; that which comprehends or relates to\n   all, or the chief part; -- opposed to particular.'),
(31917, 'General', 'a.', 'One of the chief military officers of a government or\n   country; the commander of an army, of a body of men not less than a\n   brigade. In European armies, the highest military rank next below field\n   marshal.'),
(31918, 'General', 'a.', 'The roll of the drum which calls the troops together; as,\n   to beat the general.'),
(31919, 'General', 'a.', 'The chief of an order of monks, or of all the houses or\n   congregations under the same rule.'),
(31920, 'General', 'a.', 'The public; the people; the vulgar.'),
(31921, 'Generant', 'a.', 'Generative; producing'),
(31922, 'Generant', 'a.', 'acting as a generant.'),
(31923, 'Generant', 'n.', 'That which generates.'),
(31924, 'Generant', 'n.', 'A generatrix.'),
(31925, 'Generate', 'v. t.', 'To beget; to procreate; to propagate; to produce (a\n   being similar to the parent); to engender; as, every animal generates\n   its own species.'),
(31926, 'Generate', 'v. t.', 'To cause to be; to bring into life.'),
(31927, 'Generate', 'v. t.', 'To originate, especially by a vital or chemical\n   process; to produce; to cause.'),
(31928, 'Generate', 'v. t.', 'To trace out, as a line, figure, or solid, by the\n   motion of a point or a magnitude of inferior order.'),
(31929, 'Generic', 'a.', 'Alt. of Generical'),
(31930, 'Generous', 'a.', 'Of honorable birth or origin; highborn.'),
(31931, 'Generous', 'a.', 'Exhibiting those qualities which are popularly reregarded\n   as belonging to high birth; noble; honorable; magnanimous; spirited;\n   courageous.'),
(31932, 'Generous', 'a.', 'Open-handed; free to give; not close or niggardly;\n   munificent; as, a generous friend or father.'),
(31933, 'Generous', 'a.', 'Characterized by generosity; abundant; overflowing; as, a\n   generous table.'),
(31934, 'Generous', 'a.', 'Full of spirit or strength; stimulating; exalting; as,\n   generous wine.'),
(31935, 'Genesial', 'a.', 'Of or relating to generation.'),
(31936, 'Genesis', 'n.', 'The act of producing, or giving birth or origin to\n   anything; the process or mode of originating; production; formation;\n   origination.'),
(31937, 'Genesis', 'n.', 'The first book of the Old Testament; -- so called by the\n   Greek translators, from its containing the history of the creation of\n   the world and of the human race.'),
(31938, 'Genesis', 'n.', 'Same as Generation.'),
(31939, 'Genet', 'n.', 'Alt. of Genette'),
(31940, 'Genette', 'n.', 'One of several species of small Carnivora of the genus\n   Genetta, allied to the civets, but having the scent glands less\n   developed, and without a pouch.'),
(31941, 'Genette', 'n.', 'The fur of the common genet (Genetta vulgaris); also, any\n   skin dressed in imitation of this fur.'),
(31942, 'Genet', 'n.', 'A small-sized, well-proportioned, Spanish horse; a jennet.'),
(31943, 'Genetic', 'a.', 'Same as Genetical.'),
(31944, 'Geneva', 'n.', 'The chief city of Switzerland.'),
(31945, 'Geneva', 'n.', 'A strongly alcoholic liquor, flavored with juniper berries;\n   -- made in Holland; Holland gin; Hollands.'),
(31946, 'Genevan', 'a.', 'Of or pertaining to Geneva, in Switzerland; Genevese.'),
(31947, 'Genevan', 'n.', 'A native or inhabitant of Geneva.'),
(31948, 'Genevan', 'n.', 'A supported of Genevanism.'),
(31949, 'Genevese', 'a.', 'Of or pertaining to Geneva, in Switzerland; Genevan.'),
(31950, 'Genevese', 'n. sing. & pl.', 'A native or inhabitant of Geneva;\n   collectively, the inhabitants of Geneva; people of Geneva.'),
(31951, 'Genial', 'a.', 'Same as Genian.'),
(31952, 'Genial', 'a.', 'Contributing to, or concerned in, propagation or\n   production; generative; procreative; productive.'),
(31953, 'Genial', 'a.', 'Contributing to, and sympathizing with, the enjoyment of\n   life; sympathetically cheerful and cheering; jovial and inspiring joy\n   or happiness; exciting pleasure and sympathy; enlivening; kindly; as,\n   she was of a cheerful and genial disposition.'),
(31954, 'Genial', 'a.', 'Belonging to one\'s genius or natural character; native;\n   natural; inborn.'),
(31955, 'Genial', 'a.', 'Denoting or marked with genius; belonging to the higher\n   nature.'),
(31956, 'Genially', 'adv.', 'By genius or nature; naturally.'),
(31957, 'Genially', 'adv.', 'Gayly; cheerfully.'),
(31958, 'Genian', 'a.', 'Of or pertaining to the chin; mental; as, the genian\n   prominence.'),
(31959, 'Genie', 'n.', 'See Genius.'),
(31960, 'Genio', 'n.', 'A man of a particular turn of mind.'),
(31961, 'Genipap', 'n.', 'The edible fruit of a West Indian tree (Genipa Americana)\n   of the order Rubiaceae. It is oval in shape, as a large as a small\n   orange, of a pale greenish color, and with dark purple juice.'),
(31962, 'Genista', 'n.', 'A genus of plants including the common broom of Western\n   Europe.'),
(31963, 'Genital', 'a.', 'Pertaining to generation, or to the generative organs.'),
(31964, 'Genitals', 'a.', 'The organs of generation; the sexual organs; the private\n   parts.'),
(31965, 'Geniting', 'n.', 'A species of apple that ripens very early.'),
(31966, 'Genitive', 'a.', 'Of or pertaining to that case (as the second case of\n   Latin and Greek nouns) which expresses source or possession. It\n   corresponds to the possessive case in English.'),
(31967, 'Genitive', 'n.', 'The genitive case.'),
(31968, 'Genitor', 'n.', 'One who begets; a generator; an originator.'),
(31969, 'Genitor', 'n.', 'The genitals.'),
(31970, 'Geniture', 'n.', 'Generation; procreation; birth.'),
(31971, 'Geniuses', 'pl. ', 'of Genius'),
(31972, 'Genii', 'pl. ', 'of Genius'),
(31973, 'Genius', 'n.', 'A good or evil spirit, or demon, supposed by the ancients\n   to preside over a man\'s destiny in life; a tutelary deity; a\n   supernatural being; a spirit, good or bad. Cf. Jinnee.'),
(31974, 'Genius', 'n.', 'The peculiar structure of mind with whoch each individual\n   is endowed by nature; that disposition or aptitude of mind which is\n   peculiar to each man, and which qualifies him for certain kinds of\n   action or special success in any pursuit; special taste, inclination,\n   or disposition; as, a genius for history, for poetry, or painting.'),
(31975, 'Genius', 'n.', 'Peculiar character; animating spirit, as of a nation, a\n   religion, a language.'),
(31976, 'Genius', 'n.', 'Distinguished mental superiority; uncommon intellectual\n   power; especially, superior power of invention or origination of any\n   kind, or of forming new combinations; as, a man of genius.'),
(31977, 'Genius', 'n.', 'A man endowed with uncommon vigor of mind; a man of\n   superior intellectual faculties; as, Shakespeare was a rare genius.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(31978, 'Genoese', 'a.', 'Of or pertaining to Genoa, a city of Italy.'),
(31979, 'Genoese', 'n. sing. & pl.', 'A native or inhabitant of Genoa; collectively,\n   the people of Genoa.'),
(31980, '-genous', '', 'A suffix signifying producing, yielding; as, alkaligenous;\n   endogenous.'),
(31981, 'Genre', 'n.', 'A style of painting, sculpture, or other imitative art,\n   which illustrates everyday life and manners.'),
(31982, 'Gentes', 'pl. ', 'of Gens'),
(31983, 'Genteel', 'a.', 'Possessing or exhibiting the qualities popularly regarded\n   as belonging to high birth and breeding; free from vulgarity, or\n   lowness of taste or behavior; adapted to a refined or cultivated taste;\n   polite; well-bred; as, genteel company, manners, address.'),
(31984, 'Genteel', 'a.', 'Graceful in mien or form; elegant in appearance, dress, or\n   manner; as, the lady has a genteel person. Law.'),
(31985, 'Genteel', 'a.', 'Suited to the position of lady or a gentleman; as, to live\n   in a genteel allowance.'),
(31986, 'Genterie', 'n.', 'Alt. of Gentrie'),
(31987, 'Gentrie', 'n.', 'Nobility of birth or of character; gentility.'),
(31988, 'Gentian', 'n.', 'Any one of a genus (Gentiana) of herbaceous plants with\n   opposite leaves and a tubular four- or five-lobed corolla, usually\n   blue, but sometimes white, yellow, or red. See Illust. of Capsule.'),
(31989, 'Gentil', 'a. & n.', 'Gentle.'),
(31990, 'Gentile', 'a.', 'One of a non-Jewish nation; one neither a Jew nor a\n   Christian; a worshiper of false gods; a heathen.'),
(31991, 'Gentile', 'a.', 'Belonging to the nations at large, as distinguished from\n   the Jews; ethnic; of pagan or heathen people.'),
(31992, 'Gentile', 'a.', 'Denoting a race or country; as, a gentile noun or\n   adjective.'),
(31993, 'Gentilly', 'a.', 'In a gentle or hoble manner; frankly.'),
(31994, 'Gentisin', 'n.', 'A tasteless, yellow, crystalline substance, obtained from\n   the gentian; -- called also gentianin.'),
(31995, 'Gentle', 'superl.', 'Well-born; of a good family or respectable birth,\n   though not noble.'),
(31996, 'Gentle', 'superl.', 'Quiet and refined in manners; not rough, harsh, or\n   stern; mild; meek; bland; amiable; tender; as, a gentle nature, temper,\n   or disposition; a gentle manner; a gentle address; a gentle voice.'),
(31997, 'Gentle', 'superl.', 'A compellative of respect, consideration, or\n   conciliation; as, gentle reader.'),
(31998, 'Gentle', 'superl.', 'Not wild, turbulent, or refractory; quiet and docile;\n   tame; peaceable; as, a gentle horse.'),
(31999, 'Gentle', 'superl.', 'Soft; not violent or rough; not strong, loud, or\n   disturbing; easy; soothing; pacific; as, a gentle touch; a gentle\n   gallop .'),
(32000, 'Gentle', 'n.', 'One well born; a gentleman.'),
(32001, 'Gentle', 'n.', 'A trained falcon. See Falcon-gentil.'),
(32002, 'Gentle', 'n.', 'A dipterous larva used as fish bait.'),
(32003, 'Gentle', 'v. t.', 'To make genteel; to raise from the vulgar; to ennoble.'),
(32004, 'Gentle', 'v. t.', 'To make smooth, cozy, or agreeable.'),
(32005, 'Gentle', 'v. t.', 'To make kind and docile, as a horse.'),
(32006, 'Gently', 'adv.', 'In a gentle manner.'),
(32007, 'Gentoos', 'pl. ', 'of Gentoo'),
(32008, 'Gentoo', 'n.', 'A native of Hindostan; a Hindoo.'),
(32009, 'Gentry', 'a.', 'Birth; condition; rank by birth.'),
(32010, 'Gentry', 'a.', 'People of education and good breeding; in England, in a\n   restricted sense, those between the nobility and the yeomanry.'),
(32011, 'Gentry', 'a.', 'Courtesy; civility; complaisance.'),
(32012, 'Genty', 'a.', 'Neat; trim.'),
(32013, 'Genua', 'pl. ', 'of Genu'),
(32014, 'Genuine', 'a.', 'Belonging to, or proceeding from, the original stock;\n   native; hence, not counterfeit, spurious, false, or adulterated;\n   authentic; real; natural; true; pure; as, a genuine text; a genuine\n   production; genuine materials.'),
(32015, 'Genera', 'pl. ', 'of Genus'),
(32016, 'Genus', 'n.', 'A class of objects divided into several subordinate species;\n   a class more extensive than a species; a precisely defined and exactly\n   divided class; one of the five predicable conceptions, or sorts of\n   terms.'),
(32017, 'Genus', 'n.', 'An assemblage of species, having so many fundamental points\n   of structure in common, that in the judgment of competent scientists,\n   they may receive a common substantive name. A genus is not necessarily\n   the lowest definable group of species, for it may often be divided into\n   several subgenera. In proportion as its definition is exact, it is\n   natural genus; if its definition can not be made clear, it is more or\n   less an artificial genus.'),
(32018, 'Genys', 'n.', 'See Gonys.'),
(32019, 'Geode', 'n.', 'A nodule of stone, containing a cavity, lined with crystals\n   or mineral matter.'),
(32020, 'Geode', 'n.', 'The cavity in such a nodule.'),
(32021, 'Geodesic', 'a.', 'Alt. of Geodesical'),
(32022, 'Geodesic', 'n.', 'A geodetic line or curve.'),
(32023, 'Geodesy', 'n.', 'That branch of applied mathematics which determines, by\n   means of observations and measurements, the figures and areas of large\n   portions of the earth\'s surface, or the general figure and dimenshions\n   of the earth; or that branch of surveying in which the curvature of the\n   earth is taken into account, as in the surveys of States, or of long\n   lines of coast.'),
(32024, 'Geodetic', 'a.', 'Alt. of Geodetical'),
(32025, 'Geoduck', 'n.', 'A gigantic clam (Glycimeris generosa) of the Pacific coast\n   of North America, highly valued as an article of food.'),
(32026, 'Geognost', 'n.', 'One versed in geognosy; a geologist.'),
(32027, 'Geognosy', 'n.', 'That part of geology which treats of the materials of the\n   earth\'s structure, and its general exterior and interior constitution.'),
(32028, 'Geogonic', 'a.', 'Alt. of Geogonical'),
(32029, 'Geogony', 'n.', 'The branch of science which treats of the formation of the\n   earth.'),
(32030, 'Geolatry', 'n.', 'The worship of the earth.'),
(32031, 'Geologer', 'n.', 'Alt. of Geologian'),
(32032, 'Geologic', 'a.', 'Alt. of Geological'),
(32033, 'Geology', 'n.', 'The science which treats: (a) Of the structure and mineral\n   constitution of the globe; structural geology. (b) Of its history as\n   regards rocks, minerals, rivers, valleys, mountains, climates, life,\n   etc.; historical geology. (c) Of the causes and methods by which its\n   structure, features, changes, and conditions have been produced;\n   dynamical geology. See Chart of The Geological Series.'),
(32034, 'Geology', 'n.', 'A treatise on the science.'),
(32035, 'Geomancy', 'n.', 'A kind of divination by means of figures or lines, formed\n   by little dots or points, originally on the earth, and latterly on\n   paper.'),
