(32283, 'Girdle', 'n.', 'The line ofgreatest circumference of a brilliant-cut\n   diamond, at which it is grasped by the setting. See Illust. of\n   Brilliant.'),
(32284, 'Girdle', 'n.', 'A thin bed or stratum of stone.'),
(32285, 'Girdle', 'n.', 'The clitellus of an earthworm.'),
(32286, 'Girdled', 'imp. & p. p.', 'of Girdle'),
(32287, 'Girdling', 'p. pr. & vb. n.', 'of Girdle'),
(32288, 'Girdle', 'v. t.', 'To bind with a belt or sash; to gird.'),
(32289, 'Girdle', 'v. t.', 'To inclose; to environ; to shut in.'),
(32290, 'Girdle', 'v. t.', 'To make a cut or gnaw a groove around (a tree, etc.)\n   through the bark and alburnum, thus killing it.'),
(32291, 'Girdler', 'n.', 'One who girdles.'),
(32292, 'Girdler', 'n.', 'A maker of girdles.'),
(32293, 'Girdler', 'n.', 'An American longicorn beetle (Oncideres cingulatus) which\n   lays its eggs in the twigs of the hickory, and then girdles each branch\n   by gnawing a groove around it, thus killing it to provide suitable food\n   for the larvae.'),
(32294, 'Girkin', 'n.', 'See Gherkin.'),
(32295, 'Girlhood', 'n.', 'State or time of being a girl.'),
(32296, 'Girlish', 'a.', 'Like, or characteristic of, a girl; of or pertaining to\n   girlhood; innocent; artless; immature; weak; as, girlish ways; girlish\n   grief.'),
(32297, 'Girlond', 'n.', 'A garland; a prize.'),
(32298, 'Girrock', 'n.', 'A garfish.'),
(32299, 'Girted', 'imp. & p. p.', 'of Girt'),
(32300, 'Girting', 'p. pr. & vb. n.', 'of Girt'),
(32301, 'Girth', 'n.', 'A band or strap which encircles the body; especially, one by\n   which a saddle is fastened upon the back of a horse.'),
(32302, 'Girth', 'n.', 'The measure round the body, as at the waist or belly; the\n   circumference of anything.'),
(32303, 'Girth', 'n.', 'A small horizontal brace or girder.'),
(32304, 'Girth', 'v. t.', 'To bind as with a girth.'),
(32305, 'Girtline', 'n.', 'A gantline.'),
(32306, 'Gisarm', 'n.', 'A weapon with a scythe-shaped blade, and a separate long\n   sharp point, mounted on a long staff and carried by foot soldiers.'),
(32307, 'Gisle', 'n.', 'A pledge.'),
(32308, 'Gittern', 'n.', 'An instrument like a guitar.'),
(32309, 'Gittern', 'v. i.', 'To play on gittern.'),
(32310, 'Gittith', 'n.', 'A musical instrument, of unknown character, supposed by\n   some to have been used by the people of Gath, and thence obtained by\n   David. It is mentioned in the title of Psalms viii., lxxxi., and\n   lxxxiv.'),
(32311, 'Guist', 'n.', 'Same as Joust.'),
(32312, 'Giusto', 'a.', 'In just, correct, or suitable time.'),
(32313, 'Given', 'p. p.', 'of Give'),
(32314, 'Giving', 'p. pr. & vb. n.', 'of Give'),
(32315, 'Given', '', 'p. p. & a. from Give, v.'),
(32316, 'Given', 'v.', 'Granted; assumed; supposed to be known; set forth as a known\n   quantity, relation, or premise.'),
(32317, 'Given', 'v.', 'Disposed; inclined; -- used with an adv.; as, virtuously\n   given.'),
(32318, 'Given', 'adv.', 'Stated; fixed; as, in a given time.'),
(32319, 'Giver', 'n.', 'One who gives; a donor; a bestower; a grantor; one who\n   imparts or distributes.'),
(32320, 'Gives', 'n.', 'Fetters.'),
(32321, 'Giving', 'n.', 'The act of bestowing as a gift; a conferring or imparting.'),
(32322, 'Giving', 'n.', 'A gift; a benefaction.'),
(32323, 'Giving', 'n.', 'The act of softening, breaking, or yielding.'),
(32324, 'Gizzard', 'n.', 'The second, or true, muscular stomach of birds, in which\n   the food is crushed and ground, after being softened in the glandular\n   stomach (crop), or lower part of the esophagus; the gigerium.'),
(32325, 'Gizzard', 'n.', 'A thick muscular stomach found in many invertebrate\n   animals.'),
(32326, 'Gizzard', 'n.', 'A stomach armed with chitinous or shelly plates or teeth,\n   as in certain insects and mollusks.'),
(32327, 'Glabell/', 'pl. ', 'of Glabella'),
(32328, 'Glabella', 'n.', 'The space between the eyebrows, also including the\n   corresponding part of the frontal bone; the mesophryon.'),
(32329, 'Glabella', 'pl. ', 'of Glabellum'),
(32330, 'Glabrate', 'a.', 'Becoming smooth or glabrous from age.'),
(32331, 'Glabrity', 'n.', 'Smoothness; baldness.'),
(32332, 'Glabrous', 'a.', 'Smooth; having a surface without hairs or any unevenness.'),
(32333, 'Glacial', 'a.', 'Pertaining to ice or to its action; consisting of ice;\n   frozen; icy; esp., pertaining to glaciers; as, glacial phenomena.'),
(32334, 'Glacial', 'a.', 'Resembling ice; having the appearance and consistency of\n   ice; -- said of certain solid compounds; as, glacial phosphoric or\n   acetic acids.'),
(32335, 'Glaciate', 'v. i.', 'To turn to ice.'),
(32336, 'Glaciate', 'v. t.', 'To convert into, or cover with, ice.'),
(32337, 'Glaciate', 'v. t.', 'To produce glacial effects upon, as in the scoring of\n   rocks, transportation of loose material, etc.'),
(32338, 'Glacier', 'n.', 'An immense field or stream of ice, formed in the region of\n   perpetual snow, and moving slowly down a mountain slope or valley, as\n   in the Alps, or over an extended area, as in Greenland.'),
(32339, 'Glacious', 'a.', 'Pertaining to, consisting of or resembling, ice; icy.'),
(32340, 'Glacis', 'n.', 'A gentle slope, or a smooth, gently sloping bank;\n   especially (Fort.), that slope of earth which inclines from the covered\n   way toward the exterior ground or country (see Illust. of Ravelin).'),
(32341, 'Gladded', 'imp. & p. p.', 'of Glad'),
(32342, 'Gladding', 'p. pr. & vb. n.', 'of Glad'),
(32343, 'Gladden', 'v. t.', 'To make glad; to cheer; to please; to gratify; to\n   rejoice; to exhilarate.'),
(32344, 'Gladden', 'v. i.', 'To be or become glad; to rejoice.'),
(32345, 'Gladder', 'n.', 'One who makes glad.'),
(32346, 'Glade', 'n.', 'An open passage through a wood; a grassy open or cleared\n   space in a forest.'),
(32347, 'Glade', 'n.', 'An everglade.'),
(32348, 'Glade', 'n.', 'An opening in the ice of rivers or lakes, or a place left\n   unfrozen; also, smooth ice.'),
(32349, 'Gladen', 'n.', 'Sword grass; any plant with sword-shaped leaves, esp. the\n   European Iris foetidissima.'),
(32350, 'Gladeye', 'n.', 'The European yellow-hammer.'),
(32351, 'Gladful', 'a.', 'Full of gladness; joyful; glad.'),
(32352, 'Gladiate', 'a.', 'Sword-shaped; resembling a sword in form, as the leaf of\n   the iris, or of the gladiolus.'),
(32353, 'Gladiole', 'n.', 'A lilylike plant, of the genus Gladiolus; -- called also\n   corn flag.'),
(32354, 'Gladioli', 'pl. ', 'of Gladiolus'),
(32355, 'Gladii', 'pl. ', 'of Gladius'),
(32356, 'Gladius', 'n.', 'The internal shell, or pen, of cephalopods like the\n   squids.'),
(32357, 'Gladly', 'a.', 'Preferably; by choice.'),
(32358, 'Gladly', 'a.', 'With pleasure; joyfully; cheerfully; eagerly.'),
(32359, 'Gladness', 'n.', 'State or quality of being glad; pleasure; joyful\n   satisfaction; cheerfulness.'),
(32360, 'Gladship', 'n.', 'A state of gladness.'),
(32361, 'Gladsome', 'a.', 'Pleased; joyful; cheerful.'),
(32362, 'Gladsome', 'a.', 'Causing joy, pleasure, or cheerfulness; having the\n   appearance of gayety; pleasing.'),
(32363, 'Gladwyn', 'n.', 'See Gladen.'),
(32364, 'Glair', 'a.', 'The white of egg. It is used as a size or a glaze in\n   bookbinding, for pastry, etc.'),
(32365, 'Glair', 'a.', 'Any viscous, transparent substance, resembling the white of\n   an egg.'),
(32366, 'Glair', 'a.', 'A broadsword fixed on a pike; a kind of halberd.'),
(32367, 'Glaired', 'imp. & p. p.', 'of Glair'),
(32368, 'Glairing', 'p. pr. & vb. n.', 'of Glair'),
(32369, 'Glair', 'v. t.', 'To smear with the white of an egg.'),
(32370, 'Glaire', 'n.', 'See Glair.'),
(32371, 'Glairin', 'n.', 'A glairy viscous substance, which forms on the surface of\n   certain mineral waters, or covers the sides of their inclosures; --\n   called also baregin.'),
(32372, 'Glairy', 'a.', 'Like glair, or partaking of its qualities; covered with\n   glair; viscous and transparent; slimy.'),
(32373, 'Glaive', 'n.', 'A weapon formerly used, consisting of a large blade fixed\n   on the end of a pole, whose edge was on the outside curve; also, a\n   light lance with a long sharp-pointed head.'),
(32374, 'Glaive', 'n.', 'A sword; -- used poetically and loosely.'),
(32375, 'Glama', 'n.', 'A copious gummy secretion of the humor of the eyelids, in\n   consequence of some disorder; blearedness; lippitude.'),
(32376, 'Glamour', 'n.', 'A charm affecting the eye, making objects appear different\n   from what they really are.'),
(32377, 'Glamour', 'n.', 'Witchcraft; magic; a spell.'),
(32378, 'Glamour', 'n.', 'A kind of haze in the air, causing things to appear\n   different from what they really are.'),
(32379, 'Glamour', 'n.', 'Any artificial interest in, or association with, an\n   object, through which it appears delusively magnified or glorified.'),
(32380, 'Glance', 'n.', 'A sudden flash of light or splendor.'),
(32381, 'Glance', 'n.', 'A quick cast of the eyes; a quick or a casual look; a swift\n   survey; a glimpse.'),
(32382, 'Glance', 'n.', 'An incidental or passing thought or allusion.'),
(32383, 'Glance', 'n.', 'A name given to some sulphides, mostly dark-colored, which\n   have a brilliant metallic luster, as the sulphide of copper, called\n   copper glance.'),
(32384, 'Glanced', 'imp. & p. p.', 'of Glance'),
(32385, 'Glancing', 'p. pr. & vb. n.', 'of Glance'),
(32386, 'Glance', 'v. i.', 'To shoot or emit a flash of light; to shine; to flash.'),
(32387, 'Glance', 'v. i.', 'To strike and fly off in an oblique direction; to dart\n   aside. \"Your arrow hath glanced\".'),
(32388, 'Glance', 'v. i.', 'To look with a sudden, rapid cast of the eye; to snatch\n   a momentary or hasty view.'),
(32389, 'Glance', 'v. i.', 'To make an incidental or passing reflection; to allude;\n   to hint; -- often with at.'),
(32390, 'Glance', 'v. i.', 'To move quickly, appearing and disappearing rapidly; to\n   be visible only for an instant at a time; to move interruptedly; to\n   twinkle.'),
(32391, 'Glance', 'v. t.', 'To shoot or dart suddenly or obliquely; to cast for a\n   moment; as, to glance the eye.'),
(32392, 'Glance', 'v. t.', 'To hint at; to touch lightly or briefly.'),
(32393, 'Glancing', 'a.', 'Shooting, as light.'),
(32394, 'Glancing', 'a.', 'Flying off (after striking) in an oblique direction; as,\n   a glancing shot.'),
(32395, 'Gland', 'n.', 'An organ for secreting something to be used in, or\n   eliminated from, the body; as, the sebaceous glands of the skin; the\n   salivary glands of the mouth.'),
(32396, 'Gland', 'n.', 'An organ or part which resembles a secreting, or true,\n   gland, as the ductless, lymphatic, pineal, and pituitary glands, the\n   functions of which are very imperfectly known.'),
(32397, 'Gland', 'n.', 'A special organ of plants, usually minute and globular,\n   which often secretes some kind of resinous, gummy, or aromatic product.'),
(32398, 'Gland', 'n.', 'Any very small prominence.'),
(32399, 'Gland', 'n.', 'The movable part of a stuffing box by which the packing is\n   compressed; -- sometimes called a follower. See Illust. of Stuffing\n   box, under Stuffing.'),
(32400, 'Gland', 'n.', 'The crosspiece of a bayonet clutch.'),
(32401, 'Glandage', 'n.', 'A feeding on nuts or mast.'),
(32402, 'Glanders', 'n.', 'A highly contagious and very destructive disease of\n   horses, asses, mules, etc., characterized by a constant discharge of\n   sticky matter from the nose, and an enlargement and induration of the\n   glands beneath and within the lower jaw. It may transmitted to dogs,\n   goats, sheep, and to human beings.'),
(32403, 'Glandule', 'n.', 'A small gland or secreting vessel.'),
(32404, 'Glandes', 'pl. ', 'of Glans'),
(32405, 'Glans', 'n.', 'The vascular body which forms the apex of the penis, and the\n   extremity of the clitoris.'),
(32406, 'Glans', 'n.', 'The acorn or mast of the oak and similar fruits.'),
(32407, 'Glans', 'n.', 'Goiter.'),
(32408, 'Glans', 'n.', 'A pessary.'),
(32409, 'Glared', 'imp. & p. p.', 'of Glare'),
(32410, 'Glaring', 'p. pr. & vb. n.', 'of Glare'),
(32411, 'Glare', 'v. i.', 'To shine with a bright, dazzling light.'),
(32412, 'Glare', 'v. i.', 'To look with fierce, piercing eyes; to stare earnestly,\n   angrily, or fiercely.'),
(32413, 'Glare', 'v. i.', 'To be bright and intense, as certain colors; to be\n   ostentatiously splendid or gay.'),
(32414, 'Glare', 'v. t.', 'To shoot out, or emit, as a dazzling light.'),
(32415, 'Glare', 'n.', 'A bright, dazzling light; splendor that dazzles the eyes; a\n   confusing and bewildering light.'),
(32416, 'Glare', 'n.', 'A fierce, piercing look or stare.'),
(32417, 'Glare', 'n.', 'A viscous, transparent substance. See Glair.'),
(32418, 'Glare', 'n.', 'A smooth, bright, glassy surface; as, a glare of ice.'),
(32419, 'Glare', 'n.', 'Smooth and bright or translucent; -- used almost exclusively\n   of ice; as, skating on glare ice.'),
(32420, 'Glareous', 'a.', 'Glairy.'),
(32421, 'Glaring', 'a.', 'Clear; notorious; open and bold; barefaced; as, a glaring\n   crime.'),
(32422, 'Glary', 'a.', 'Of a dazzling luster; glaring; bright; shining; smooth.'),
(32423, 'Glass', 'v. t.', 'A hard, brittle, translucent, and commonly transparent\n   substance, white or colored, having a conchoidal fracture, and made by\n   fusing together sand or silica with lime, potash, soda, or lead oxide.\n   It is used for window panes and mirrors, for articles of table and\n   culinary use, for lenses, and various articles of ornament.'),
(32424, 'Glass', 'v. t.', 'Any substance having a peculiar glassy appearance, and a\n   conchoidal fracture, and usually produced by fusion.'),
(32425, 'Glass', 'v. t.', 'Anything made of glass.'),
(32426, 'Glass', 'v. t.', 'A looking-glass; a mirror.'),
(32427, 'Glass', 'v. t.', 'A vessel filled with running sand for measuring time; an\n   hourglass; and hence, the time in which such a vessel is exhausted of\n   its sand.'),
(32428, 'Glass', 'v. t.', 'A drinking vessel; a tumbler; a goblet; hence, the\n   contents of such a vessel; especially; spirituous liquors; as, he took\n   a glass at dinner.'),
(32429, 'Glass', 'v. t.', 'An optical glass; a lens; a spyglass; -- in the plural,\n   spectacles; as, a pair of glasses; he wears glasses.'),
(32430, 'Glass', 'v. t.', 'A weatherglass; a barometer.'),
(32431, 'Glassed', 'imp. & p. p.', 'of Glass'),
(32432, 'Glassing', 'p. pr. & vb. n.', 'of Glass'),
(32433, 'Glass', 'v. t.', 'To reflect, as in a mirror; to mirror; -- used\n   reflexively.'),
(32434, 'Glass', 'v. t.', 'To case in glass.'),
(32435, 'Glass', 'v. t.', 'To cover or furnish with glass; to glaze.'),
(32436, 'Glass', 'v. t.', 'To smooth or polish anything, as leater, by rubbing it\n   with a glass burnisher.'),
(32437, 'Glassen', 'a.', 'Glassy; glazed.'),
(32438, 'Glasseye', 'n.', 'A fish of the great lakes; the wall-eyed pike.'),
(32439, 'Glasseye', 'n.', 'A species of blindness in horses in which the eye is\n   bright and the pupil dilated; a sort of amaurosis.'),
(32440, 'Glassful', 'n.', 'The contents of a glass; as much of anything as a glass\n   will hold.'),
(32441, 'Glassful', 'a.', 'Glassy; shining like glass.'),
(32442, 'Glassily', 'adv.', 'So as to resemble glass.'),
(32443, 'Glassite', 'n.', 'A member of a Scottish sect, founded in the 18th century\n   by John Glass, a minister of the Established Church of Scotland, who\n   taught that justifying faith is \"no more than a simple assent to the\n   divine testimone passively recived by the understanding.\" The English\n   and American adherents of this faith are called Sandemanians, after\n   Robert Sandeman, the son-in-law and disciple of Glass.'),
(32444, 'Glassy', 'a.', 'Made of glass; vitreous; as, a glassy substance.'),
(32445, 'Glassy', 'a.', 'Resembling glass in its properties, as in smoothness,\n   brittleness, or transparency; as, a glassy stream; a glassy surface;\n   the glassy deep.'),
(32446, 'Glassy', 'a.', 'Dull; wanting life or fire; lackluster; -- said of the\n   eyes.'),
(32447, 'Glasynge', 'n.', 'Glazing or glass.'),
(32448, 'Glaucic', 'a.', 'Of or pertaining to the Glaucium or horned poppy; --\n   formerly applied to an acid derived from it, now known to be fumaric\n   acid.'),
(32449, 'Glaucine', 'a.', 'Glaucous or glaucescent.'),
(32450, 'Glaucine', 'n.', 'An alkaloid obtained from the plant Glaucium, as a\n   bitter, white, crystalline substance.'),
(32451, 'Glaucoma', 'n.', 'Dimness or abolition of sight, with a diminution of\n   transparency, a bluish or greenish tinge of the refracting media of the\n   eye, and a hard inelastic condition of the eyeball, with marked\n   increase of tension within the eyeball.'),
(32452, 'Glaucous', 'a.', 'Of a sea-green color; of a dull green passing into\n   grayish blue.'),
(32453, 'Glaucous', 'a.', 'Covered with a fine bloom or fine white powder easily\n   rubbed off, as that on a blue plum, or on a cabbage leaf.'),
(32454, 'Glaucus', 'n.', 'A genus of nudibranchiate mollusks, found in the warmer\n   latitudes, swimming in the open sea. These mollusks are beautifully\n   colored with blue and silvery white.'),
(32455, 'Glaum', 'v. i.', 'To grope with the hands, as in the dark.'),
(32456, 'Glave', 'n.', 'See Glaive.'),
(32457, 'Glaver', 'v. i.', 'To prate; to jabber; to babble.'),
(32458, 'Glaver', 'v. i.', 'To flatter; to wheedle.'),
(32459, 'Glaverer', 'n.', 'A flatterer.'),
(32460, 'Glaymore', 'n.', 'A claymore.'),
(32461, 'Glased', 'imp. & p. p.', 'of Glase'),
(32462, 'Glazing', 'p. pr. & vb. n.', 'of Glase'),
(32463, 'Glase', 'v. t.', 'To furnish (a window, a house, a sash, a ease, etc.) with\n   glass.'),
(32464, 'Glase', 'v. t.', 'To incrust, cover, or overlay with a thin surface,\n   consisting of, or resembling, glass; as, to glaze earthenware; hence,\n   to render smooth, glasslike, or glossy; as, to glaze paper, gunpowder,\n   and the like.'),
(32465, 'Glase', 'v. t.', 'To apply thinly a transparent or semitransparent color to\n   (another color), to modify the effect.'),
(32466, 'Glaze', 'v. i.', 'To become glazed of glassy.'),
(32467, 'Glaze', 'n.', 'The vitreous coating of pottery or porcelain; anything used\n   as a coating or color in glazing. See Glaze, v. t., 3.'),
(32468, 'Glaze', 'v. t.', 'Broth reduced by boiling to a gelatinous paste, and\n   spread thinly over braised dishes.'),
(32469, 'Glaze', 'v. t.', 'A glazing oven. See Glost oven.'),
(32470, 'Glazen', 'a.', 'Resembling glass; glasslike; glazed.'),
(32471, 'Glazer', 'n.', 'One who applies glazing, as in pottery manufacture, etc.;\n   one who gives a glasslike or glossy surface to anything; a calenderer\n   or smoother of cloth, paper, and the like.'),
(32472, 'Glazer', 'n.', 'A tool or machine used in glazing, polishing, smoothing,\n   etc.; amoung cutlers and lapidaries, a wooden wheel covered with emery,\n   or having a band of lead and tin alloy, for polishing cutlery, etc.'),
(32473, 'Glazier', 'n.', 'One whose business is to set glass.'),
(32474, 'Glazing', 'n.', 'The act or art of setting glass; the art of covering with\n   a vitreous or glasslike substance, or of polishing or rendering glossy.'),
(32475, 'Glazing', 'n.', 'The glass set, or to be set, in a sash, frame. etc.'),
(32476, 'Glazing', 'n.', 'The glass, glasslike, or glossy substance with which any\n   surface is incrusted or overlaid; as, the glazing of pottery or\n   porcelain, or of paper.'),
(32477, 'Glazing', 'n.', 'Transparent, or semitransparent, colors passed thinly over\n   other colors, to modify the effect.'),
(32478, 'Glazy', 'a.', 'Having a glazed appearance; -- said of the fractured surface\n   of some kinds of pin iron.'),
(32479, 'Glead', 'n.', 'A live coal. See Gleed.'),
(32480, 'Gleam', 'v. i.', 'To disgorge filth, as a hawk.'),
(32481, 'Gleam', 'n.', 'A shoot of light; a small stream of light; a beam; a ray; a\n   glimpse.'),
(32482, 'Gleam', 'n.', 'Brightness; splendor.'),
(32483, 'Gleamed', 'imp. & p. p.', 'of Gleam'),
(32484, 'Gleaming', 'p. pr. & vb. n.', 'of Gleam'),
(32485, 'Gleam', 'v. t.', 'To shoot, or dart, as rays of light; as, at the dawn,\n   light gleams in the east.'),
(32486, 'Gleam', 'v. t.', 'To shine; to cast light; to glitter.'),
(32487, 'Gleam', 'v. t.', 'To shoot out (flashes of light, etc.).'),
(32488, 'Gleamy', 'a.', 'Darting beams of light; casting light in rays; flashing;\n   coruscating.'),
(32489, 'Gleaned', 'imp. & p. p.', 'of Glean'),
(32490, 'Gleaning', 'p. pr. & vb. n.', 'of Glean'),
(32491, 'Glean', 'v. t.', 'To gather after a reaper; to collect in scattered or\n   fragmentary parcels, as the grain left by a reaper, or grapes left\n   after the gathering.'),
(32492, 'Glean', 'v. t.', 'To gather from (a field or vineyard) what is left.'),
(32493, 'Glean', 'v. t.', 'To collect with patient and minute labor; to pick out; to\n   obtain.'),
(32494, 'Glean', 'v. i.', 'To gather stalks or ears of grain left by reapers.'),
(32495, 'Glean', 'v. i.', 'To pick up or gather anything by degrees.'),
(32496, 'Glean', 'n.', 'A collection made by gleaning.'),
(32497, 'Glean', 'n.', 'Cleaning; afterbirth.'),
(32498, 'Gleaner', 'n.', 'One who gathers after reapers.'),
(32499, 'Gleaner', 'n.', 'One who gathers slowly with labor.'),
(32500, 'Gleaning', 'n.', 'The act of gathering after reapers; that which is\n   collected by gleaning.'),
(32501, 'Glebe', 'n.', 'A lump; a clod.'),
(32502, 'Glebe', 'n.', 'Turf; soil; ground; sod.'),
(32503, 'Glebe', 'n.', 'The land belonging, or yielding revenue, to a parish church\n   or ecclesiastical benefice.'),
(32504, 'Glebous', 'a.', 'Alt. of Gleby'),
(32505, 'Gleby', 'a.', 'Pertaining to the glebe; turfy; cloddy; fertile; fruitful.'),
(32506, 'Glede', 'v. i.', 'The common European kite (Milvus ictinus). This name is\n   also sometimes applied to the buzzard.'),
(32507, 'Glede', 'n.', 'A live coal.'),
(32508, 'Gleed', 'v. i.', 'A live or glowing coal; a glede.'),
(32509, 'Gleeful', 'a.', 'Merry; gay; joyous.'),
(32510, 'Gleek', 'n.', 'A jest or scoff; a trick or deception.'),
(32511, 'Gleek', 'n.', 'An enticing look or glance.'),
(32512, 'Gleek', 'v. i.', 'To make sport; to gibe; to sneer; to spend time idly.'),
(32513, 'Gleek', 'n.', 'A game at cards, once popular, played by three persons.'),
(32514, 'Gleek', 'n.', 'Three of the same cards held in the same hand; -- hence,\n   three of anything.'),
(32515, 'Gleemen', 'pl. ', 'of Gleeman'),
(32516, 'Gleeman', 'n.', 'A name anciently given to an itinerant minstrel or\n   musician.'),
(32517, 'Gleen', 'v. i.', 'To glisten; to gleam.'),
(32518, 'Gleesome', 'a.', 'Merry; joyous; gleeful.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(32519, 'Gleet', 'n.', 'A transparent mucous discharge from the membrane of the\n   urethra, commonly an effect of gonorrhea.'),
(32520, 'Gleet', 'v. i.', 'To flow in a thin, limpid humor; to ooze, as gleet.'),
(32521, 'Gleet', 'v. i.', 'To flow slowly, as water.'),
(32522, 'Gleety', 'a.', 'Ichorous; thin; limpid.'),
(32523, 'Gleire', 'n.', 'Alt. of Gleyre'),
(32524, 'Gleyre', 'n.', 'See Glair.'),
(32525, 'Glenoid', 'a.', 'Having the form of a smooth and shallow depression;\n   socketlike; -- applied to several articular surfaces of bone; as, the\n   glenoid cavity, or fossa, of the scapula, in which the head of the\n   humerus articulates.'),
(32526, 'Glent', 'n. & v.', 'See Glint.'),
(32527, 'Gliadin', 'n.', 'Vegetable glue or gelatin; glutin. It is one of the\n   constituents of wheat gluten, and is a tough, amorphous substance,\n   which resembles animal glue or gelatin.'),
(32528, 'Gilbbery', 'a.', 'Slippery; changeable.'),
(32529, 'Gilbbery', 'a.', 'Moving easily; nimble; voluble.'),
(32530, 'Glibly', 'adv.', 'In a glib manner; as, to speak glibly.'),
(32531, 'Glibness', 'n.', 'The quality of being glib.'),
(32532, 'Glicke', 'n.', 'An ogling look.'),
(32533, 'Glidden', '', 'p. p. of Glide.'),
(32534, 'Glidder', 'a.', 'Alt. of Gliddery'),
(32535, 'Gliddery', 'a.', 'Giving no sure footing; smooth; slippery.'),
(32536, 'Glide', 'n.', 'The glede or kite.'),
(32537, 'Glided', 'imp. & p. p.', 'of Glide'),
(32538, 'Gliding', 'p. pr. & vb. n.', 'of Glide'),
(32539, 'Glide', 'v. i.', 'To move gently and smoothly; to pass along without noise,\n   violence, or apparent effort; to pass rapidly and easily, or with a\n   smooth, silent motion, as a river in its channel, a bird in the air, a\n   skater over ice.'),
(32540, 'Glide', 'v. i.', 'To pass with a glide, as the voice.'),
(32541, 'Glide', 'n.', 'The act or manner of moving smoothly, swiftly, and without\n   labor or obstruction.'),
(32542, 'Glide', 'n.', 'A transitional sound in speech which is produced by the\n   changing of the mouth organs from one definite position to another, and\n   with gradual change in the most frequent cases; as in passing from the\n   begining to the end of a regular diphthong, or from vowel to consonant\n   or consonant to vowel in a syllable, or from one component to the other\n   of a double or diphthongal consonant (see Guide to Pronunciation, //\n   19, 161, 162). Also (by Bell and others), the vanish (or brief final\n   element) or the brief initial element, in a class of diphthongal\n   vowels, or the brief final or initial part of some consonants (see\n   Guide to Pronunciation, // 18, 97, 191).'),
(32543, 'Gliden', '', 'p. p. of Glide.'),
(32544, 'Glider', 'n.', 'One who, or that which, glides.'),
(32545, 'Gliff', 'n.', 'A transient glance; an unexpected view of something that\n   startles one; a sudden fear.'),
(32546, 'Gliff', 'n.', 'A moment: as, for a gliff.'),
(32547, 'Glike', 'n.', 'A sneer; a flout.'),
(32548, 'Glimmer', 'v. i.', 'To give feeble or scattered rays of light; to shine\n   faintly; to show a faint, unsteady light; as, the glimmering dawn; a\n   glimmering lamp.'),
(32549, 'Glimmer', 'n.', 'A faint, unsteady light; feeble, scattered rays of light;\n   also, a gleam.'),
(32550, 'Glimmer', 'n.', 'Mica. See Mica.'),
(32551, 'Glimpse', 'n.', 'A sudden flash; transient luster.'),
(32552, 'Glimpse', 'n.', 'A short, hurried view; a transitory or fragmentary\n   perception; a quick sight.'),
(32553, 'Glimpse', 'n.', 'A faint idea; an inkling.'),
(32554, 'Glimpsed', 'imp. & p. p.', 'of Glimpse'),
(32555, 'Glimpse', 'v. i.', 'to appear by glimpses; to catch glimpses.'),
(32556, 'Glimpse', 'v. t.', 'To catch a glimpse of; to see by glimpses; to have a\n   short or hurried view of.'),
(32557, 'Glint', 'n.', 'A glimpse, glance, or gleam.'),
(32558, 'Glinted', 'imp. & p. p.', 'of Glint'),
(32559, 'Glinting', 'p. pr. & vb. n.', 'of Glint'),
(32560, 'Glint', 'v. i.', 'To glance; to peep forth, as a flower from the bud; to\n   glitter.'),
(32561, 'Glint', 'v. t.', 'To glance; to turn; as, to glint the eye.'),
(32562, 'Glioma', 'n.', 'A tumor springing from the neuroglia or connective tissue\n   of the brain, spinal cord, or other portions of the nervous system.'),
(32563, 'Glires', 'n. pl.', 'An order of mammals; the Rodentia.'),
(32564, 'Glissade', 'n.', 'A sliding, as down a snow slope in the Alps.'),
(32565, 'Glist', 'n.', 'Glimmer; mica.'),
(32566, 'Glisten', 'v. i.', 'To sparkle or shine; especially, to shine with a mild,\n   subdued, and fitful luster; to emit a soft, scintillating light; to\n   gleam; as, the glistening stars.'),
(32567, 'Glister', 'v. i.', 'To be bright; to sparkle; to be brilliant; to shine; to\n   glisten; to glitter.'),
(32568, 'Glister', 'n.', 'Glitter; luster.'),
(32569, 'Glitter', 'v. i.', 'To sparkle with light; to shine with a brilliant and\n   broken light or showy luster; to gleam; as, a glittering sword.'),
(32570, 'Glitter', 'v. i.', 'To be showy, specious, or striking, and hence\n   attractive; as, the glittering scenes of a court.'),
(32571, 'Glitter', 'n.', 'A bright, sparkling light; brilliant and showy luster;\n   brilliancy; as, the glitter of arms; the glitter of royal equipage.'),
(32572, 'Gloam', 'v. i.', 'To begin to grow dark; to grow dusky.'),
(32573, 'Gloam', 'v. i.', 'To be sullen or morose.'),
(32574, 'Gloam', 'n.', 'The twilight; gloaming.'),
(32575, 'Gloaming', 'n.', 'Twilight; dusk; the fall of the evening.'),
(32576, 'Gloaming', 'n.', 'Sullenness; melancholy.'),
(32577, 'Gloar', 'v. i.', 'To squint; to stare.'),
(32578, 'Gloated', 'imp. & p. p.', 'of Gloat'),
(32579, 'Gloating', 'p. pr. & vb. n.', 'of Gloat'),
(32580, 'Gloat', 'v. i.', 'To look steadfastly; to gaze earnestly; -- usually in a\n   bad sense, to gaze with malignant satisfaction, passionate desire,\n   lust, or avarice.'),
(32581, 'Globard', 'n.', 'A glowworm.'),
(32582, 'Globate', 'a.', 'Alt. of Globated'),
(32583, 'Globated', 'a.', 'Having the form of a globe; spherical.'),
(32584, 'Globe', 'n.', 'A round or spherical body, solid or hollow; a body whose\n   surface is in every part equidistant from the center; a ball; a sphere.'),
(32585, 'Globe', 'n.', 'Anything which is nearly spherical or globular in shape; as,\n   the globe of the eye; the globe of a lamp.'),
(32586, 'Globe', 'n.', 'The earth; the terraqueous ball; -- usually preceded by the\n   definite article.'),
(32587, 'Globe', 'n.', 'A round model of the world; a spherical representation of\n   the earth or heavens; as, a terrestrial or celestial globe; -- called\n   also artificial globe.'),
(32588, 'Globe', 'n.', 'A body of troops, or of men or animals, drawn up in a\n   circle; -- a military formation used by the Romans, answering to the\n   modern infantry square.'),
(32589, 'Globed', 'imp. & p. p.', 'of Globe'),
(32590, 'Globing', 'p. pr. & vb. n.', 'of Globe'),
(32591, 'Globe', 'v. t.', 'To gather or form into a globe.'),
(32592, 'Globose', 'a.', 'Having a rounded form resembling that of a globe;\n   globular, or nearly so; spherical.'),
(32593, 'Globous', 'a.', 'Spherical.'),
(32594, 'Globular', 'a.', 'Globe-shaped; having the form of a ball or sphere;\n   spherical, or nearly so; as, globular atoms.'),
(32595, 'Globule', 'n.', 'A little globe; a small particle of matter, of a spherical\n   form.'),
(32596, 'Globule', 'n.', 'A minute spherical or rounded structure; as blood, lymph,\n   and pus corpuscles, minute fungi, spores, etc.'),
(32597, 'Globule', 'n.', 'A little pill or pellet used by homeopathists.'),
(32598, 'Globulet', 'n.', 'A little globule.'),
(32599, 'Globulin', 'n.', 'An albuminous body, insoluble in water, but soluble in\n   dilute solutions of salt. It is present in the red blood corpuscles\n   united with haematin to form haemoglobin. It is also found in the\n   crystalline lens of the eye, and in blood serum, and is sometimes\n   called crystallin. In the plural the word is applied to a group of\n   proteid substances such as vitellin, myosin, fibrinogen, etc., all\n   insoluble in water, but soluble in dilute salt solutions.'),
(32600, 'Globy', 'a.', 'Resembling, or pertaining to, a globe; round; orbicular.'),
(32601, 'Glode', '', 'imp. of Glide.'),
(32602, 'Glombe', 'v. i.', 'Alt. of Glome'),
(32603, 'Glome', 'v. i.', 'To gloom; to look gloomy, morose, or sullen.'),
(32604, 'Glome', 'n.', 'Gloom.'),
(32605, 'Glome', 'n.', 'One of the two prominences at the posterior extremity of the\n   frog of the horse\'s foot.'),
(32606, 'Glonoin', 'n.', 'Alt. of Glonoine'),
(32607, 'Glonoine', 'n.', 'Same as Nitroglycerin; -- called also oil of glonoin.'),
(32608, 'Glonoine', 'n.', 'A dilute solution of nitroglycerin used as a neurotic.'),
(32609, 'Gloom', 'n.', 'Partial or total darkness; thick shade; obscurity; as, the\n   gloom of a forest, or of midnight.'),
(32610, 'Gloom', 'n.', 'A shady, gloomy, or dark place or grove.'),
(32611, 'Gloom', 'n.', 'Cloudiness or heaviness of mind; melancholy; aspect of\n   sorrow; low spirits; dullness.'),
(32612, 'Gloom', 'n.', 'In gunpowder manufacture, the drying oven.'),
(32613, 'Gloomed', 'imp. & p. p.', 'of Gloom'),
(32614, 'Glooming', 'p. pr. & vb. n.', 'of Gloom'),
(32615, 'Gloom', 'v. i.', 'To shine or appear obscurely or imperfectly; to glimmer.'),
(32616, 'Gloom', 'v. i.', 'To become dark or dim; to be or appear dismal, gloomy, or\n   sad; to come to the evening twilight.'),
(32617, 'Gloom', 'v. t.', 'To render gloomy or dark; to obscure; to darken.'),
(32618, 'Gloom', 'v. t.', 'To fill with gloom; to make sad, dismal, or sullen.'),
(32619, 'Gloomily', 'adv.', 'In a gloomy manner.'),
(32620, 'Glooming', 'n.', 'Twilight (of morning or evening); the gloaming.'),
(32621, 'Gloomth', 'n.', 'Gloom.'),
(32622, 'Gloomy', 'superl.', 'Imperfectly illuminated; dismal through obscurity or\n   darkness; dusky; dim; clouded; as, the cavern was gloomy.'),
(32623, 'Gloomy', 'superl.', 'Affected with, or expressing, gloom; melancholy;\n   dejected; as, a gloomy temper or countenance.'),
(32624, 'Gloppen', 'v. t. & i.', 'To surprise or astonish; to be startled or\n   astonished.'),
(32625, 'Glore', 'v. i.', 'To glare; to glower.'),
(32626, 'Gloria', 'n.', 'A doxology (beginning Gloria Patri, Glory be to the\n   Father), sung or said at the end of the Psalms in the service of the\n   Roman Catholic and other churches.'),
(32627, 'Gloria', 'n.', 'A portion of the Mass (Gloria in Excelsis Deo, Glory be to\n   God on high), and also of the communion service in some churches. In\n   the Episcopal Church the version in English is used.'),
(32628, 'Gloria', 'n.', 'The musical setting of a gloria.'),
(32629, 'Gloried', 'a.', 'Illustrious; honorable; noble.'),
(32630, 'Glorify', 'v. t.', 'To make glorious by bestowing glory upon; to confer\n   honor and distinction upon; to elevate to power or happiness, or to\n   celestial glory.'),
(32631, 'Glorify', 'v. t.', 'To make glorious in thought or with the heart, by\n   ascribing glory to; to asknowledge the excellence of; to render homage\n   to; to magnify in worship; to adore.'),
(32632, 'Gloriole', 'n.', 'An aureole.'),
(32633, 'Gloriosa', 'n.', 'A genus of climbing plants with very showy lilylike\n   blossoms, natives of India.'),
(32634, 'Glorioso', 'n.', 'A boaster.'),
(32635, 'Glorious', 'n.', 'Exhibiting attributes, qualities, or acts that are worthy\n   of or receive glory; noble; praiseworthy; excellent; splendid;\n   illustrious; inspiring admiration; as, glorious deeds.'),
(32636, 'Glorious', 'n.', 'Eager for glory or distinction; haughty; boastful;\n   ostentatious; vainglorious.'),
(32637, 'Glorious', 'n.', 'Ecstatic; hilarious; elated with drink.'),
(32638, 'Glory', 'n.', 'Praise, honor, admiration, or distinction, accorded by\n   common consent to a person or thing; high reputation; honorable fame;\n   renown.'),
(32639, 'Glory', 'n.', 'That quality in a person or thing which secures general\n   praise or honor; that which brings or gives renown; an object of pride\n   or boast; the occasion of praise; excellency; brilliancy; splendor.'),
(32640, 'Glory', 'n.', 'Pride; boastfulness; arrogance.'),
(32641, 'Glory', 'n.', 'The presence of the Divine Being; the manifestations of the\n   divine nature and favor to the blessed in heaven; celestial honor;\n   heaven.'),
(32642, 'Glory', 'n.', 'An emanation of light supposed to proceed from beings of\n   peculiar sanctity. It is represented in art by rays of gold, or the\n   like, proceeding from the head or body, or by a disk, or a mere line.'),
(32643, 'Gloried', 'imp. & p. p.', 'of Glory'),
(32644, 'Glorying', 'p. pr. & vb. n.', 'of Glory'),
(32645, 'Glory', 'n.', 'To exult with joy; to rejoice.'),
(32646, 'Glory', 'n.', 'To boast; to be proud.'),
(32647, 'Glose', 'n. & v.', 'See Gloze.'),
(32648, 'Gloser', 'n.', 'See Glosser.'),
(32649, 'Gloss', 'n.', 'Brightness or luster of a body proceeding from a smooth\n   surface; polish; as, the gloss of silk; cloth is calendered to give it\n   a gloss.'),
(32650, 'Gloss', 'n.', 'A specious appearance; superficial quality or show.'),
(32651, 'Glossed', 'imp. & p. p.', 'of Gloss'),
(32652, 'Glossing', 'p. pr. & vb. n.', 'of Gloss'),
(32653, 'Gloss', 'v. t.', 'To give a superficial luster or gloss to; to make smooth\n   and shining; as, to gloss cloth.'),
(32654, 'Gloss', 'n.', 'A foreign, archaic, technical, or other uncommon word\n   requiring explanation.'),
(32655, 'Gloss', 'n.', 'An interpretation, consisting of one or more words,\n   interlinear or marginal; an explanatory note or comment; a running\n   commentary.'),
(32656, 'Gloss', 'n.', 'A false or specious explanation.'),
(32657, 'Gloss', 'v. t.', 'To render clear and evident by comments; to illustrate;\n   to explain; to annotate.'),
(32658, 'Gloss', 'v. t.', 'To give a specious appearance to; to render specious and\n   plausible; to palliate by specious explanation.'),
(32659, 'Gloss', 'v. i.', 'To make comments; to comment; to explain.'),
(32660, 'Gloss', 'v. i.', 'To make sly remarks, or insinuations.'),
(32661, 'Gloss/', 'pl. ', 'of Glossa'),
(32662, 'Glossa', 'n.', 'The tongue, or lingua, of an insect. See Hymenoptera.'),
(32663, 'Glossal', 'a.', 'Of or pertaining to the tongue; lingual.'),
(32664, 'Glossary', 'n.', 'A collection of glosses or explanations of words and\n   passages of a work or author; a partial dictionary of a work, an\n   author, a dialect, art, or science, explaining archaic, technical, or\n   other uncommon words.'),
(32665, 'Glossata', 'n. pl.', 'The Lepidoptera.'),
(32666, 'Glosser', 'n.', 'A polisher; one who gives a luster.'),
(32667, 'Glosser', 'n.', 'A writer of glosses; a scholiast; a commentator.'),
(32668, 'Glossic', 'n.', 'A system of phonetic spelling based upon the present\n   values of English letters, but invariably using one symbol to represent\n   one sound only.'),
(32669, 'Glossily', 'adv.', 'In a glossy manner.'),
(32670, 'Glossist', 'n.', 'A writer of comments.'),
(32671, 'Glossly', 'adv.', 'Like gloss; specious.'),
(32672, 'Glossy', 'superl.', 'Smooth and shining; reflecting luster from a smooth\n   surface; highly polished; lustrous; as, glossy silk; a glossy surface.'),
(32673, 'Glossy', 'superl.', 'Smooth; specious; plausible; as, glossy deceit.'),
(32674, 'Glottal', 'a.', 'Of or pertaining to, or produced by, the glottis; glottic.'),
(32675, 'Glottic', 'a.', 'Alt. of Glottidean'),
(32676, 'Glottis', 'n.', 'The opening from the pharynx into the larynx or into the\n   trachea. See Larynx.'),
(32677, 'Glout', 'v. i.', 'To pout; to look sullen.'),
(32678, 'Glout', 'v. t.', 'To view attentively; to gloat on; to stare at.'),
(32679, 'Glove', 'n.', 'A cover for the hand, or for the hand and wrist, with a\n   separate sheath for each finger. The latter characteristic\n   distinguishes the glove from the mitten.'),
(32680, 'Glove', 'n.', 'A boxing glove.'),
(32681, 'Gloved', 'imp. & p. p.', 'of Glove'),
(32682, 'Gloving', 'p. pr. & vb. n.', 'of Glove'),
(32683, 'Glove', 'v. t.', 'To cover with, or as with, a glove.'),
(32684, 'Glover', 'n.', 'One whose trade it is to make or sell gloves.'),
(32685, 'Glowed', 'imp. & p. p.', 'of Glow'),
(32686, 'Glowing', 'p. pr. & vb. n.', 'of Glow'),
(32687, 'Glowbard', 'n.', 'The glowworm.'),
(32688, 'Glowered', 'imp. & p. p.', 'of Glower'),
(32689, 'Glower', 'v. i.', 'to look intently; to stare angrily or with a scowl.'),
(32690, 'Glowlamp', 'n.', 'An aphlogistic lamp. See Aphlogistic.'),
(32691, 'Glowlamp', 'n.', 'An incandescent lamp. See Incandescent, a.'),
(32692, 'Glowworm', 'n.', 'A coleopterous insect of the genus Lampyris; esp., the\n   wingless females and larvae of the two European species (L. noctiluca,\n   and L. splendidula), which emit light from some of the abdominal\n   segments.'),
(32693, 'Gloxinia', 'n.', 'American genus of herbaceous plants with very handsome\n   bell-shaped blossoms; -- named after B. P. Gloxin, a German botanist.'),
(32694, 'Glozed', 'imp. & p. p.', 'of Gloze'),
(32695, 'Glozing', 'p. pr. & vb. n.', 'of Gloze'),
(32696, 'Gloze', 'v. i.', 'To flatter; to wheedle; to fawn; to talk smoothly.'),
(32697, 'Gloze', 'v. i.', 'To give a specious or false meaning; to ministerpret.'),
(32698, 'Gloze', 'v. t.', 'To smooth over; to palliate.'),
(32699, 'Gloze', 'n.', 'Flattery; adulation; smooth speech.'),
(32700, 'Gloze', 'n.', 'Specious show; gloss.'),
(32701, 'Glozer', 'n.', 'A flatterer.'),
(32702, 'Glucic', 'a.', 'Pertaining to, or obtained from, sugar; as, glucic acid.'),
(32703, 'Glucina', 'n.', 'A white or gray tasteless powder, the oxide of the element\n   glucinum; -- formerly called glucine.'),
(32704, 'Glucinic', 'a.', 'Pertaining to, derived from, or containing, glucinum; as,\n   glucinic oxide.'),
(32705, 'Glucinum', 'n.', 'A rare metallic element, of a silver white color, and low\n   specific gravity (2.1), resembling magnesium. It never occurs naturally\n   in the free state, but is always combined, usually with silica or\n   alumina, or both; as in the minerals phenacite, chrysoberyl, beryl or\n   emerald, euclase, and danalite. It was named from its oxide glucina,\n   which was known long before the element was isolated. Symbol Gl. Atomic\n   weight 9.1. Called also beryllium.'),
(32706, 'Glucogen', 'n.', 'See Glycogen.'),
(32707, 'Gluconic', 'a.', 'Pertaining to, or derived from, glucose.'),
(32708, 'Glucose', 'n.', 'A variety of sugar occurring in nature very abundantly, as\n   in ripe grapes, and in honey, and produced in great quantities from\n   starch, etc., by the action of heat and acids. It is only about half as\n   sweet as cane sugar. Called also dextrose, grape sugar, diabetic sugar,\n   and starch sugar. See Dextrose.'),
(32709, 'Glucose', 'n.', 'Any one of a large class of sugars, isometric with glucose\n   proper, and including levulose, galactose, etc.'),
(32710, 'Glucose', 'n.', 'The trade name of a sirup, obtained as an uncrystallizable\n   reside in the manufacture of glucose proper, and containing, in\n   addition to some dextrose or glucose, also maltose, dextrin, etc. It is\n   used as a cheap adulterant of sirups, beers, etc.'),
(32711, 'Glued', 'imp. & p. p.', 'of Glue'),
(32712, 'Gluing', 'p. pr. & vb. n.', 'of Glue'),
(32713, 'Gluepot', 'n.', 'A utensil for melting glue, consisting of an inner pot\n   holding the glue, immersed in an outer one containing water which is\n   heated to soften the glue.'),
(32714, 'Gluer', 'n.', 'One who cements with glue.'),
(32715, 'Gluey', 'a.', 'Viscous; glutinous; of the nature of, or like, glue.'),
(32716, 'Gluish', 'a.', 'Somewhat gluey.'),
(32717, 'Glumal', 'a.', 'Characterized by a glume, or having the nature of a glume.'),
(32718, 'Glume', 'n.', 'The bracteal covering of the flowers or seeds of grain and\n   grasses; esp., an outer husk or bract of a spikelt.'),
(32719, 'Glumella', 'n.', 'Alt. of Glumelle'),
(32720, 'Glumelle', 'n.', 'One of the pelets or inner chaffy scales of the flowers\n   or spikelets of grasses.'),
(32721, 'Glumly', 'adv.', 'In a glum manner; sullenly; moodily.'),
(32722, 'Glummy', 'a.', 'dark; gloomy; dismal.'),
(32723, 'Glumness', 'n.', 'Moodiness; sullenness.'),
(32724, 'Glump', 'v. i.', 'To manifest sullenness; to sulk.'),
(32725, 'Glumpy', 'a.', 'Glum; sullen; sulky.'),
(32726, 'Glunch', 'a.', 'Frowning; sulky; sullen.'),
(32727, 'Glunch', 'n.', 'A sullen, angry look; a look of disdain or dislike.'),
(32728, 'Glutted', 'imp. & p. p.', 'of Glut'),
(32729, 'Glutting', 'p. pr. & vb. n.', 'of Glut'),
(32730, 'Glutaeus', 'n.', 'The great muscle of the buttock in man and most mammals,\n   and the corresponding muscle in many lower animals.'),
(32731, 'Glutamic', 'a.', 'Of or pertaining to gluten.'),
(32732, 'Glutaric', 'a.', 'Of, pertaining to, or designating, an acid so called; as,\n   glutaric ethers.'),
(32733, 'Gluteal', 'a.', 'Pertaining to, or in the region of, the glutaeus.'),
(32734, 'Gluten', 'n.', 'The viscid, tenacious substance which gives adhesiveness to\n   dough.'),
(32735, 'Gluteus', 'n.', 'Same as Glut/us.'),
(32736, 'Glutin', 'n.', 'Same as Gliadin.'),
(32737, 'Glutin', 'n.', 'Sometimes synonymous with Gelatin.'),
(32738, 'Glutton', 'n.', 'One who eats voraciously, or to excess; a gormandizer.'),
(32739, 'Glutton', 'n.', 'Fig.: One who gluts himself.'),
(32740, 'Glutton', 'n.', 'A carnivorous mammal (Gulo luscus), of the family\n   Mustelidae, about the size of a large badger. It was formerly believed\n   to be inordinately voracious, whence the name; the wolverene. It is a\n   native of the northern parts of America, Europe, and Asia.'),
(32741, 'Glutton', 'a.', 'Gluttonous; greedy; gormandizing.'),
(32742, 'Glutton', 'v. t. & i.', 'To glut; to eat voraciously.'),
(32743, 'Gluttony', 'n.', 'Excess in eating; extravagant indulgence of the appetite\n   for food; voracity.'),
(32744, 'Glyceric', 'a.', 'Pertaining to, or derived from, glycerin.'),
(32745, 'Glycerin', 'n.', 'Alt. of Glycerine'),
(32746, 'Glycerol', 'n.', 'Same as Glycerin.'),
(32747, 'Glyceryl', 'n.', 'A compound radical, C3H5, regarded as the essential\n   radical of glycerin. It is metameric with allyl. Called also propenyl.'),
(32748, 'Glycide', 'n.', 'A colorless liquid, obtained from certain derivatives of\n   glycerin, and regarded as a partially dehydrated glycerin; -- called\n   also glycidic alcohol.'),
(32749, 'Glycidic', 'a.', 'Pertaining to, or derived from, glycide; as, glycidic\n   acid.'),
(32750, 'Glycin', 'n.', 'Same as Glycocoll.'),
(32751, 'Glycocin', 'n.', 'Same as Glycocoll.'),
(32752, 'Glycogen', 'n.', 'A white, amorphous, tasteless substance resembling\n   starch, soluble in water to an opalescent fluid. It is found abundantly\n   in the liver of most animals, and in small quantity in other organs and\n   tissues, particularly in the embryo. It is quickly changed into sugar\n   when boiled with dilute sulphuric or hydrochloric acid, and also by the\n   action of amylolytic ferments.'),
(32753, 'Glycol', 'n.', 'A thick, colorless liquid, C2H4(OH)2, of a sweetish taste,\n   produced artificially from certain ethylene compounds. It is a diacid\n   alcohol, intermediate between ordinary ethyl alcohol and glycerin.'),
(32754, 'Glycol', 'n.', 'Any one of the large class of diacid alcohols, of which\n   glycol proper is the type.'),
(32755, 'Glycolic', 'a.', 'Pertaining to, or derived from, glycol; as, glycolic\n   ether; glycolic acid.'),
(32756, 'Glycolyl', 'n.', 'A divalent, compound radical, CO.CH2, regarded as the\n   essential radical of glycolic acid, and a large series of related\n   compounds.'),
(32757, 'Glyconic', 'a.', 'Consisting of a spondee, a choriamb, and a pyrrhic; --\n   applied to a kind of verse in Greek and Latin poetry.'),
(32758, 'Glyconic', 'n.', 'A glyconic verse.'),
(32759, 'Glyconin', 'n.', 'An emulsion of glycerin and the yolk of eggs, used as an\n   ointment, as a vehicle for medicines, etc.'),
(32760, 'Glynne', 'n.', 'A glen. See Glen. [Obs. singly, but occurring often in\n   locative names in Ireland, as Glen does in Scotland.]'),
(32761, 'Glyoxal', 'n.', 'A white, amorphous, deliquescent powder, (CO.H)2, obtained\n   by the partial oxidation of glycol. It is a double aldehyde, between\n   glycol and oxalic acid.'),
(32762, 'Glyoxime', 'n.', 'A white, crystalline, nitrogenous substance, produced by\n   the action of hydroxylamine on glyoxal, and belonging to the class of\n   oximes; also, any one of a group of substances resembling glyoxime\n   proper, and of which it is a type. See Oxime.'),
(32763, 'Glyph', 'n.', 'A sunken channel or groove, usually vertical. See Triglyph.'),
(32764, 'Glyphic', 'a.', 'Of or pertaining to sculpture or carving of any sort, esp.\n   to glyphs.'),
(32765, 'Glyptic', 'a.', 'Of or pertaining to gem engraving.'),
(32766, 'Glyptic', 'a.', 'Figured; marked as with figures.'),
(32767, 'Glyptics', 'n.', 'The art of engraving on precious stones.'),
(32768, 'Glyster', 'n.', 'Same as Clyster.'),
(32769, 'Gnarred', 'imp. & p. p.', 'of Gnar'),
(32770, 'Gnarring', 'p. pr. & vb. n.', 'of Gnar'),
(32771, 'Gnarled', 'imp. & p. p.', 'of Gnarl'),
(32772, 'Gnarling', 'p. pr. & vb. n.', 'of Gnarl'),
(32773, 'Gnarl', 'v. i.', 'To growl; to snarl.'),
(32774, 'Gnarl', 'n.', 'a knot in wood; a large or hard knot, or a protuberance with\n   twisted grain, on a tree.'),
(32775, 'Gnarled', 'a.', 'Knotty; full of knots or gnarls; twisted; crossgrained.'),
(32776, 'Gnarly', 'a.', 'Full of knots; knotty; twisted; crossgrained.'),
(32777, 'Gnashed', 'imp. & p. p.', 'of Gnash'),
(32778, 'Gnashing', 'p. pr. & vb. n.', 'of Gnash'),
(32779, 'Gnash', 'v. t.', 'To strike together, as in anger or pain; as, to gnash the\n   teeth.'),
(32780, 'Gnash', 'v. i.', 'To grind or strike the teeth together.'),
(32781, 'Gnathic', 'a.', 'Of or pertaining to the jaw.'),
(32782, 'Gnathite', 'n.', 'Any one of the mouth appendages of the Arthropoda. They\n   are known as mandibles, maxillae, and maxillipeds.'),
(32783, 'Gnatling', 'n.', 'A small gnat.'),
(32784, 'Gnatworm', 'n.', 'The aquatic larva of a gnat; -- called also,\n   colloquially, wiggler.'),
(32785, 'Gnawed', 'imp. & p. p.', 'of Gnaw'),
(32786, 'Gnawing', 'p. pr. & vb. n.', 'of Gnaw'),
(32787, 'Gnawer', 'n.', 'One who, or that which, gnaws.'),
(32788, 'Gnawer', 'n.', 'A rodent.'),
(32789, 'Gneiss', 'n.', 'A crystalline rock, consisting, like granite, of quartz,\n   feldspar, and mica, but having these materials, especially the mica,\n   arranged in planes, so that it breaks rather easily into coarse slabs\n   or flags. Hornblende sometimes takes the place of the mica, and it is\n   then called hornblendic / syenitic gneiss. Similar varieties of related\n   rocks are also called gneiss.'),
(32790, 'Gneissic', 'a.', 'Relating to, or resembling, gneiss; consisting of gneiss.'),
(32791, 'Gnide', 'v. t.', 'To rub; to bruise; to break in pieces.'),
(32792, 'Gnome', 'n.', 'An imaginary being, supposed by the Rosicrucians to inhabit\n   the inner parts of the earth, and to be the guardian of mines,\n   quarries, etc.'),
(32793, 'Gnome', 'n.', 'A dwarf; a goblin; a person of small stature or misshapen\n   features, or of strange appearance.'),
(32794, 'Gnome', 'n.', 'A small owl (Glaucidium gnoma) of the Western United States.'),
(32795, 'Gnome', 'n.', 'A brief reflection or maxim.'),
(32796, 'Gnomic', 'a.', 'Alt. of Gnomical'),
(32797, 'Gnomical', 'a.', 'Sententious; uttering or containing maxims, or striking\n   detached thoughts; aphoristic.'),
(32798, 'Gnomical', 'a.', 'Gnomonical.'),
(32799, 'Gnomon', 'n.', 'The style or pin, which by its shadow, shows the hour of\n   the day. It is usually set parallel to the earth\'s axis.'),
(32800, 'Gnomon', 'n.', 'A style or column erected perpendicularly to the horizon,\n   formerly used in astronomocal observations. Its principal use was to\n   find the altitude of the sun by measuring the length of its shadow.'),
(32801, 'Gnomon', 'n.', 'The space included between the boundary lines of two\n   similar parallelograms, the one within the other, with an angle in\n   common; as, the gnomon bcdefg of the parallelograms ac and af. The\n   parallelogram bf is the complement of the parallelogram df.'),
(32802, 'Gnomon', 'n.', 'The index of the hour circle of a globe.'),
(32803, 'Gnomonic', 'a.', 'Alt. of Gnomonical'),
(32804, 'Gnosis', 'n.', 'The deeper wisdom; knowledge of spiritual truth, such as\n   was claimed by the Gnostics.'),
(32805, 'Gnostic', 'a.', 'Knowing; wise; shrewd.'),
(32806, 'Gnostic', 'a.', 'Of or pertaining to Gnosticism or its adherents; as, the\n   Gnostic heresy.'),
(32807, 'Gnostic', 'n.', 'One of the so-called philosophers in the first ages of\n   Christianity, who claimed a true philosophical interpretation of the\n   Christian religion. Their system combined Oriental theology and Greek\n   philosophy with the doctrines of Christianity. They held that all\n   natures, intelligible, intellectual, and material, are derived from the\n   Deity by successive emanations, which they called Eons.'),
(32808, 'Going', 'p. pr. & vb. n.', 'of Go'),
(32809, 'Goaded', 'imp. & p. p.', 'of Goad'),
(32810, 'Goading', 'p. pr. & vb. n.', 'of Goad'),
(32811, 'Goafs', 'pl. ', 'of Goaf'),
(32812, 'Goaves', 'pl. ', 'of Goaf'),
(32813, 'Goarish', 'a.', 'Patched; mean.'),
(32814, 'Goatee', 'n.', 'A part of a man\'s beard on the chin or lower lip which is\n   allowed to grow, and trimmed so as to resemble the beard of a goat.'),
(32815, 'Goatfish', 'n.', 'A fish of the genus Upeneus, inhabiting the Gulf of\n   Mexico. It is allied to the surmullet.'),
(32816, 'Goatherd', 'n.', 'One who tends goats.'),
(32817, 'Goatish', 'a.', 'Characteristic of a goat; goatlike.'),
(32818, 'Goatlike', 'a.', 'Like a goat; goatish.'),
(32819, 'Goatskin', 'n.', 'The skin of a goat, or leather made from it.'),
(32820, 'Goatskin', 'a.', 'Made of the skin of a goat.'),
(32821, 'Goaves', 'n.', 'Old workings. See Goaf.'),
(32822, 'Gobbet', 'n.', 'A mouthful; a lump; a small piece.'),
(32823, 'Gobbet', 'v. t.', 'To swallow greedily; to swallow in gobbets.'),
(32824, 'Gobbetly', 'adv.', 'In pieces.'),
(32825, 'Gobbing', 'n.', 'The refuse thrown back into the excavation after removing\n   the coal. It is called also gob stuff.'),
(32826, 'Gobbing', 'n.', 'The process of packing with waste rock; stowing.'),
(32827, 'Gobbled', 'imp. & p. p.', 'of Gobble'),
(32828, 'Gobbling', 'p. pr. & vb. n.', 'of Gobble'),
(32829, 'Gobble', 'v. t.', 'To swallow or eat greedily or hastily; to gulp.'),
(32830, 'Gobble', 'v. t.', 'To utter (a sound) like a turkey cock.'),
(32831, 'Gobble', 'v. i.', 'To eat greedily.'),
(32832, 'Gobble', 'v. i.', 'To make a noise like that of a turkey cock.'),
(32833, 'Gobble', 'n.', 'A noise made in the throat.'),
(32834, 'Gobbler', 'n.', 'A turkey cock; a bubbling Jock.'),
(32835, 'Gobelin', 'a.', 'Pertaining to tapestry produced in the so-called Gobelin\n   works, which have been maintained by the French Government since 1667.'),
(32836, 'Gobet', 'n.', 'See Gobbet.'),
(32837, 'Gobioid', 'a.', 'Like, or pertaining to, the goby, or the genus Gobius.'),
(32838, 'Gobioid', 'n.', 'A gobioid fish.'),
(32839, 'Goblet', 'n.', 'A kind of cup or drinking vessel having a foot or standard,\n   but without a handle.'),
(32840, 'Goblin', 'n.', 'An evil or mischievous spirit; a playful or malicious elf;\n   a frightful phantom; a gnome.'),
(32841, 'Gobline', 'n.', 'One of the ropes or chains serving as stays for the\n   dolphin striker or the bowsprit; -- called also gobrope and gaubline.'),
(32842, 'Gobies', 'pl. ', 'of Goby'),
(32843, 'Go-by', 'n.', 'A passing without notice; intentional neglect; thrusting\n   away; a shifting off; adieu; as, to give a proposal the go-by.'),
(32844, 'Gocart', 'n.', 'A framework moving on casters, designed to support children\n   while learning to walk.'),
(32845, 'Godchild', 'n.', 'One for whom a person becomes sponsor at baptism, and\n   whom he promises to see educated as a Christian; a godson or\n   goddaughter. See Godfather.'),
(32846, 'Goddess', 'n.', 'A female god; a divinity, or deity, of the female sex.'),
(32847, 'Goddess', 'n.', 'A woman of superior charms or excellence.'),
(32848, 'Godelich', 'a.', 'Goodly.'),
(32849, 'Godhead', 'n.', 'Godship; deity; divinity; divine nature or essence;\n   godhood.'),
(32850, 'Godhead', 'n.', 'The Deity; God; the Supreme Being.'),
(32851, 'Godhead', 'n.', 'A god or goddess; a divinity.'),
(32852, 'Godhood', 'n.', 'Divine nature or essence; deity; godhead.'),
(32853, 'Godild', '', 'A corruption of God yield, i. e., God reward or bless.'),
(32854, 'Godless', 'a.', 'Having, or acknowledging, no God; without reverence for\n   God; impious; wicked.'),
(32855, 'Godlike', 'a.', 'Resembling or befitting a god or God; divine; hence,\n   preeminently good; as, godlike virtue.'),
(32856, 'Godlily', 'adv.', 'Righteously.'),
(32857, 'Godling', 'n.', 'A diminutive god.'),
(32858, 'Godly', 'n.', 'Pious; reverencing God, and his character and laws; obedient\n   to the commands of God from love for, and reverence of, his character;\n   conformed to God\'s law; devout; righteous; as, a godly life.'),
(32859, 'Godly', 'adv.', 'Piously; devoutly; righteously.'),
(32860, 'Godown', 'n.', 'A warehouse.'),
(32861, 'Godroon', 'n.', 'An ornament produced by notching or carving a rounded\n   molding.'),
(32862, 'Godsend', 'n.', 'Something sent by God; an unexpected acquisiton or piece\n   of good fortune.'),
(32863, 'Godship', 'n.', 'The rank or character of a god; deity; divinity; a god or\n   goddess.'),
(32864, 'Godsib', 'n.', 'A gossip.'),
(32865, 'Godson', 'n.', 'A male for whom one has stood sponsor in baptism. See\n   Godfather.'),
(32866, 'Godspeed', 'n.', 'Success; prosperous journeying; -- a contraction of the\n   phrase, \"God speed you.\"'),
(32867, 'Godward', 'adv.', 'Toward God.'),
(32868, 'Godwit', 'n.', 'One of several species of long-billed, wading birds of the\n   genus Limosa, and family Tringidae. The European black-tailed godwit\n   (Limosa limosa), the American marbled godwit (L. fedoa), the Hudsonian\n   godwit (L. haemastica), and others, are valued as game birds. Called\n   also godwin.'),
(32869, 'Goeland', 'n.', 'A white tropical tern (Cygis candida).'),
(32870, 'Goemin', 'n.', 'A complex mixture of several substances extracted from\n   Irish moss.'),
(32871, 'Goety', 'n.', 'Invocation of evil spirits; witchcraft.'),
(32872, 'Goffered', 'imp. & p. p.', 'of Goffer'),
(32873, 'Goffer', 'v. t.', 'To plait, flute, or crimp. See Gauffer.'),
(32874, 'Goggled', 'imp. & p. p.', 'of Goggle'),
(32875, 'Goggling', 'p. pr. & vb. n.', 'of Goggle'),
(32876, 'Goggle', 'v. i.', 'To roll the eyes; to stare.'),
(32877, 'Goggle', 'a.', 'Full and rolling, or staring; -- said of the eyes.'),
(32878, 'Goggle', 'v. i.', 'A strained or affected rolling of the eye.'),
(32879, 'Goggle', 'v. i.', 'A kind of spectacles with short, projecting eye tubes,\n   in the front end of which are fixed plain glasses for protecting the\n   eyes from cold, dust, etc.'),
(32880, 'Goggle', 'v. i.', 'Colored glasses for relief from intense light.'),
(32881, 'Goggle', 'v. i.', 'A disk with a small aperture, to direct the sight\n   forward, and cure squinting.'),
(32882, 'Goggle', 'v. i.', 'Any screen or cover for the eyes, with or without a slit\n   for seeing through.'),
(32883, 'Goggled', 'a.', 'Prominent; staring, as the eye.'),
(32884, 'Goggler', 'n.', 'A carangoid oceanic fish (Trachurops crumenophthalmus),\n   having very large and prominent eyes; -- called also goggle-eye,\n   big-eyed scad, and cicharra.'),
(32885, 'Goglet', 'n.', 'See Gurglet.'),
(32886, 'Going', 'n.', 'The act of moving in any manner; traveling; as, the going is\n   bad.'),
(32887, 'Going', 'n.', 'Departure.'),
(32888, 'Going', 'n.', 'Pregnancy; gestation; childbearing.'),
(32889, 'Going', 'n.', 'Course of life; behavior; doings; ways.'),
(32890, 'Goiter', 'n.', 'Alt. of Goitre'),
(32891, 'Goitre', 'n.', 'An enlargement of the thyroid gland, on the anterior part\n   of the neck; bronchocele. It is frequently associated with cretinism,\n   and is most common in mountainous regions, especially in certain parts\n   of Switzerland.'),
(32892, 'Goitered', 'a.', 'Alt. of Goitred'),
(32893, 'Goitred', 'a.', 'Affected with goiter.'),
(32894, 'Goitrous', 'a.', 'Pertaining to the goiter; affected with the goiter; of\n   the nature of goiter or bronchocele.'),
(32895, 'Golde', 'n.', 'Alt. of Goolde'),
(32896, 'Goolde', 'n.', 'An old English name of some yellow flower, -- the marigold\n   (Calendula), according to Dr. Prior, but in Chaucer perhaps the\n   turnsole.'),
(32897, 'Goldcup', 'n.', 'The cuckoobud.'),
(32898, 'Golden', 'a.', 'Made of gold; consisting of gold.'),
(32899, 'Golden', 'a.', 'Having the color of gold; as, the golden grain.'),
(32900, 'Golden', 'a.', 'Very precious; highly valuable; excellent; eminently\n   auspicious; as, golden opinions.'),
(32901, 'Goden ly', 'adv.', 'In golden terms or a golden manner; splendidly;\n   delightfully.'),
(32902, 'Goldfish', 'n.', 'A small domesticated cyprinoid fish (Carassius auratus);\n   -- so named from its color. It is native of China, and is said to have\n   been introduced into Europe in 1691. It is often kept as an ornament,\n   in small ponds or glass globes. Many varieties are known. Called also\n   golden fish, and golden carp. See Telescope fish, under Telescope.'),
(32903, 'Goldfish', 'n.', 'A California marine fish of an orange or red color; the\n   garibaldi.'),
(32904, 'Goldie', 'n.', 'The European goldfinch.'),
(32905, 'Goldie', 'n.', 'The yellow-hammer.'),
(32906, 'Goldin', 'n.', 'Alt. of Golding'),
(32907, 'Golding', 'n.', 'A conspicuous yellow flower, commonly the corn marigold\n   (Chrysanthemum segetum).'),
(32908, 'Goldless', 'a.', 'Destitute of gold.'),
(32909, 'Goldney', 'n.', 'See Gilthead.'),
(32910, 'Goldseed', 'n.', 'Dog\'s-tail grass.'),
(32911, 'Goldtit', 'n.', 'See Verdin.'),
(32912, 'Golet', 'n.', 'The gullet.'),
(32913, 'Golet', 'n.', 'A California trout. See Malma.'),
(32914, 'Golfer', 'n.', 'One who plays golf.'),
(32915, 'Golgotha', 'n.', 'Calvary. See the Note under Calvary.'),
(32916, 'Goliard', 'n.', 'A buffoon in the Middle Ages, who attended rich men\'s\n   tables to make sport for the guests by ribald stories and songs.'),
(32917, 'Golore', 'n.', 'See Galore.'),
(32918, 'Goloshe', 'n.', 'See Galoche.'),
(32919, 'Goman', 'n.', 'A husband; a master of a family.'),
(32920, 'Gomarist', 'n.', 'Alt. of Gomarite'),
(32921, 'Gomarite', 'n.', 'One of the followers of Francis Gomar or Gomarus, a Dutch\n   disciple of Calvin in the 17th century, who strongly opposed the\n   Arminians.'),
(32922, 'Gombo', 'n.', 'See Gumbo.'),
(32923, 'Gomer', 'n.', 'A Hebrew measure. See Homer.'),
(32924, 'Gomer', 'n.', 'A conical chamber at the breech of the bore in heavy\n   ordnance, especially in mortars; -- named after the inventor.'),
(32925, 'Gommelin', 'n.', 'See Dextrin.'),
(32926, 'Gomuti', 'n.', 'A black, fibrous substance resembling horsehair, obtained\n   from the leafstalks of two kinds of palms, Metroxylon Sagu, and Arenga\n   saccharifera, of the Indian islands. It is used for making cordage.\n   Called also ejoo.'),
(32927, 'Gonads', 'pl. ', 'of Gonad'),
(32928, 'Gonad', 'n.', 'One of the masses of generative tissue primitively alike in\n   both sexes, but giving rise to either an ovary or a testis; a\n   generative gland; a germ gland.'),
(32929, 'Gonakie', 'n.', 'An African timber tree (Acacia Adansonii).'),
(32930, 'Gonangia', 'pl. ', 'of Gonangium'),
(32931, 'Gondola', 'n.', 'A long, narrow boat with a high prow and stern, used in\n   the canals of Venice. A gondola is usually propelled by one or two\n   oarsmen who stand facing the prow, or by poling. A gondola for\n   passengers has a small open cabin amidships, for their protection\n   against the sun or rain. A sumptuary law of Venice required that\n   gondolas should be painted black, and they are customarily so painted\n   now.'),
(32932, 'Gondola', 'n.', 'A flat-bottomed boat for freight.'),
(32933, 'Gondola', 'n.', 'A long platform car, either having no sides or with very\n   low sides, used on railroads.'),
(32934, 'Gondolet', 'n.', 'A small gondola.'),
(32935, 'Goneness', 'n.', 'A state of exhaustion; faintness, especially as resulting\n   from hunger.'),
(32936, 'Gonfalon', 'n.', 'Alt. of Gonfanon'),
(32937, 'Gonfanon', 'n.', 'The ensign or standard in use by certain princes or\n   states, such as the mediaeval republics of Italy, and in more recent\n   times by the pope.'),
(32938, 'Gonfanon', 'n.', 'A name popularly given to any flag which hangs from a\n   crosspiece or frame instead of from the staff or the mast itself.'),
(32939, 'Gonidial', 'a.', 'Pertaining to, or containing, gonidia.'),
(32940, 'Gonidial', 'a.', 'Of or pertaining to the angles of the mouth; as, a\n   gonidial groove of an actinian.'),
(32941, 'Gonidium', 'n.', 'A special groove or furrow at one or both angles of the\n   mouth of many Anthozoa.'),
(32942, 'Gonidia', 'pl. ', 'of Gonidium'),
(32943, 'Gonidium', 'n.', 'A component cell of the yellowish green layer in certain\n   lichens.'),
(32944, 'Gonimia', 'n. pl.', 'Bluish green granules which occur in certain lichens,\n   as Collema, Peltigera, etc., and which replace the more usual gonidia.'),
(32945, 'Gonimous', 'a.', 'Pertaining to, or containing, gonidia or gonimia, as that\n   part of a lichen which contains the green or chlorophyll-bearing cells.'),
(32946, 'Gonoph', 'n.', 'A pickpocket or thief.'),
(32947, 'Gonosome', 'n.', 'The reproductive zooids of a hydroid colony,\n   collectively.'),
(32948, 'Gonydial', 'a.', 'Pertaining to the gonys of a bird\'s beak.'),
(32949, 'Gonys', 'n.', 'The keel or lower outline of a bird\'s bill, so far as the\n   mandibular rami are united.'),
(32950, 'Goober', 'n.', 'A peanut.'),
(32951, 'Good-by', 'n. / interj.', 'Alt. of Good-bye'),
(32952, 'Good-bye', 'n. / interj.', 'Farewell; a form of address used at parting.\n   See the last Note under By, prep.'),
(32953, 'Good-den', 'interj.', 'A form of salutation.'),
(32954, 'Goodgeon', 'n.', 'Same as Gudgeon, 5.'),
(32955, 'Goodish', 'a.', 'Rather good than the contrary; not actually bad;\n   tolerable.'),
(32956, 'Goodless', 'a.', 'Having no goods.'),
(32957, 'Goodlich', 'a.', 'Goodly.'),
(32958, 'Goodly', 'adv.', 'Excellently.'),
(32959, 'Goodly', 'superl.', 'Pleasant; agreeable; desirable.'),
(32960, 'Goodly', 'superl.', 'Of pleasing appearance or character; comely; graceful;\n   as, a goodly person; goodly raiment, houses.'),
(32961, 'Goodly', 'superl.', 'Large; considerable; portly; as, a goodly number.'),
(32962, 'Goodman', 'n.', 'A familiar appellation of civility, equivalent to \"My\n   friend\", \"Good sir\", \"Mister;\" -- sometimes used ironically.'),
(32963, 'Goodman', 'n.', 'A husband; the master of a house or family; -- often used\n   in speaking familiarly.'),
(32964, 'Goodness', 'n.', 'The quality of being good in any of its various senses;\n   excellence; virtue; kindness; benevolence; as, the goodness of timber,\n   of a soil, of food; goodness of character, of disposition, of conduct,\n   etc.'),
(32965, 'Good now', '', 'An exclamation of wonder, surprise, or entreaty.'),
(32966, 'Goods', 'n. pl.', 'See Good, n., 3.'),
(32967, 'Goodship', 'n.', 'Favor; grace.'),
(32968, 'Goodwife', 'n.', 'The mistress of a house.'),
(32969, 'Goodies', 'pl. ', 'of Goody'),
(32970, 'Goody', 'n.', 'A bonbon, cake, or the like; -- usually in the pl.'),
(32971, 'Goody', 'n.', 'An American fish; the lafayette or spot.'),
(32972, 'Goodies', 'pl. ', 'of Goody'),
(32973, 'Goody', 'n.', 'Goodwife; -- a low term of civility or sport.'),
(32974, 'Gooroo', 'n.', 'Alt. of Guru'),
(32975, 'Geese', 'pl. ', 'of Goose'),
(32976, 'Goose', 'n.', 'Any large web-footen bird of the subfamily Anserinae, and\n   belonging to Anser, Branta, Chen, and several allied genera. See\n   Anseres.'),
(32977, 'Goose', 'n.', 'Any large bird of other related families, resembling the\n   common goose.'),
(32978, 'Goose', 'n.', 'A tailor\'s smoothing iron, so called from its handle, which\n   resembles the neck of a goose.'),
(32979, 'Goose', 'n.', 'A silly creature; a simpleton.'),
(32980, 'Goose', 'n.', 'A game played with counters on a board divided into\n   compartments, in some of which a goose was depicted.'),
(32981, 'Goosery', 'n.', 'A place for keeping geese.'),
(32982, 'Goosery', 'n.', 'The characteristics or actions of a goose; silliness.'),
(32983, 'Goosish', 'a.', 'Like a goose; foolish.'),
(32984, 'Goost', 'n.', 'Ghost; spirit.'),
(32985, 'Go-out', 'n.', 'A sluice in embankments against the sea, for letting out\n   the land waters, when the tide is out.'),
(32986, 'Gopher', 'n.', 'One of several North American burrowing rodents of the\n   genera Geomys and Thomomys, of the family Geomyidae; -- called also\n   pocket gopher and pouched rat. See Pocket gopher, and Tucan.'),
(32987, 'Gopher', 'n.', 'One of several western American species of the genus\n   Spermophilus, of the family Sciuridae; as, the gray gopher\n   (Spermophilus Franklini) and the striped gopher (S. tridecemlineatus);\n   -- called also striped prairie squirrel, leopard marmot, and leopard\n   spermophile. See Spermophile.'),
(32988, 'Gopher', 'n.', 'A large land tortoise (Testudo Carilina) of the Southern\n   United States, which makes extensive burrows.'),
(32989, 'Gopher', 'n.', 'A large burrowing snake (Spilotes Couperi) of the Southern\n   United States.'),
(32990, 'Goracco', 'n.', 'A paste prepared from tobacco, and smoked in hookahs in\n   Western India.'),
(32991, 'Goral', 'n.', 'An Indian goat antelope (Nemorhedus goral), resembling the\n   chamois.'),
(32992, 'Goramy', 'n.', 'Same as Gourami.'),
(32993, 'Gorce', 'n.', 'A pool of water to keep fish in; a wear.'),
(32994, 'Gorcock', 'n.', 'The moor cock, or red grouse. See Grouse.'),
(32995, 'Gorcrow', 'n.', 'The carrion crow; -- called also gercrow.'),
(32996, 'Gordian', 'a.', 'Pertaining to Gordius, king of Phrygia, or to a knot tied\n   by him; hence, intricate; complicated; inextricable.'),
(32997, 'Gordian', 'a.', 'Pertaining to the Gordiacea.'),
(32998, 'Gordian', 'n.', 'One of the Gordiacea.'),
(32999, 'Gordius', 'n.', 'A genus of long, slender, nematoid worms, parasitic in\n   insects until near maturity, when they leave the insect, and live in\n   water, in which they deposit their eggs; -- called also hair eel,\n   hairworm, and hair snake, from the absurd, but common and widely\n   diffused, notion that they are metamorphosed horsehairs.'),
(33000, 'Gored', 'imp. & p. p.', 'of Gore'),
(33001, 'Goring', 'p. pr. & vb. n.', 'of Gore'),
(33002, 'Gorebill', 'n.', 'The garfish.'),
(33003, 'Gorflies', 'pl. ', 'of Gorfly'),
(33004, 'Gorfly', 'n.', 'A dung fly.'),
(33005, 'Gorge', 'n.', 'The throat; the gullet; the canal by which food passes to\n   the stomach.'),
(33006, 'Gorge', 'n.', 'A narrow passage or entrance'),
(33007, 'Gorge', 'n.', 'A defile between mountains.'),
(33008, 'Gorge', 'n.', 'The entrance into a bastion or other outwork of a fort; --\n   usually synonymous with rear. See Illust. of Bastion.'),
(33009, 'Gorge', 'n.', 'That which is gorged or swallowed, especially by a hawk or\n   other fowl.'),
(33010, 'Gorge', 'n.', 'A filling or choking of a passage or channel by an\n   obstruction; as, an ice gorge in a river.'),
(33011, 'Gorge', 'n.', 'A concave molding; a cavetto.'),
(33012, 'Gorge', 'n.', 'The groove of a pulley.'),
(33013, 'Gorged', 'imp. & p. p.', 'of Gorge'),
(33014, 'Gorging', 'p. pr. & vb. n.', 'of Gorge'),
(33015, 'Gorge', 'n.', 'To swallow; especially, to swallow with greediness, or in\n   large mouthfuls or quantities.'),
(33016, 'Gorge', 'n.', 'To glut; to fill up to the throat; to satiate.'),
(33017, 'Gorge', 'v. i.', 'To eat greedily and to satiety.'),
(33018, 'Gorged', 'a.', 'Having a gorge or throat.'),
(33019, 'Gorged', 'a.', 'Bearing a coronet or ring about the neck.'),
(33020, 'Gorged', 'a.', 'Glutted; fed to the full.'),
(33021, 'Gorgelet', 'n.', 'A small gorget, as of a humming bird.'),
(33022, 'Gorgeous', 'n.', 'Imposing through splendid or various colors; showy; fine;\n   magnificent.'),
(33023, 'Gorgerin', 'n.', 'In some columns, that part of the capital between the\n   termination of the shaft and the annulet of the echinus, or the space\n   between two neck moldings; -- called also neck of the capital, and\n   hypotrachelium. See Illust. of Column.'),
(33024, 'Gorget', 'n.', 'A piece of armor, whether of chain mail or of plate,\n   defending the throat and upper part of the breast, and forming a part\n   of the double breastplate of the 14th century.'),
(33025, 'Gorget', 'n.', 'A piece of plate armor covering the same parts and worn\n   over the buff coat in the 17th century, and without other steel armor.'),
(33026, 'Gorget', 'n.', 'A small ornamental plate, usually crescent-shaped, and of\n   gilded copper, formerly hung around the neck of officers in full\n   uniform in some modern armies.'),
(33027, 'Gorget', 'n.', 'A ruff worn by women.'),
(33028, 'Gorget', 'n.', 'A cutting instrument used in lithotomy.'),
(33029, 'Gorget', 'n.', 'A grooved instrunent used in performing various operations;\n   -- called also blunt gorget.'),
(33030, 'Gorget', 'n.', 'A crescent-shaped, colored patch on the neck of a bird or\n   mammal.'),
(33031, 'Gorgon', 'n.', 'One of three fabled sisters, Stheno, Euryale, and Medusa,\n   with snaky hair and of terrific aspect, the sight of whom turned the\n   beholder to stone. The name is particularly given to Medusa.'),
(33032, 'Gorgon', 'n.', 'Anything very ugly or horrid.'),
(33033, 'Gorgon', 'n.', 'The brindled gnu. See Gnu.'),
(33034, 'Gorgon', 'a.', 'Like a Gorgon; very ugly or terrific; as, a Gorgon face.'),
(33035, 'Gorgonia', 'n.', 'A genus of Gorgoniacea, formerly very extensive, but now\n   restricted to such species as the West Indian sea fan (Gorgonia\n   flabellum), sea plume (G. setosa), and other allied species having a\n   flexible, horny axis.'),
(33036, 'Gorgonia', 'n.', 'Any slender branched gorgonian.'),
(33037, 'Gorhen', 'n.', 'The female of the gorcock.'),
(33038, 'Gorilla', 'n.', 'A large, arboreal, anthropoid ape of West Africa. It is\n   larger than a man, and is remarkable for its massive skeleton and\n   powerful muscles, which give it enormous strength. In some respects its\n   anatomy, more than that of any other ape, except the chimpanzee,\n   resembles that of man.'),
(33039, 'Goring', 'n.', 'Alt. of Goring cloth'),
(33040, 'Gorma', 'n.', 'The European cormorant.'),
(33041, 'Gormand', 'n.', 'A greedy or ravenous eater; a luxurious feeder; a\n   gourmand.'),
(33042, 'Gormand', 'a.', 'Gluttonous; voracious.'),
(33043, 'Gorse', 'n.', 'Furze. See Furze.'),
(33044, 'Goshawk', 'n.', 'Any large hawk of the genus Astur, of which many species\n   and varieties are known. The European (Astur palumbarius) and the\n   American (A. atricapillus) are the best known species. They are noted\n   for their powerful flight, activity, and courage. The Australian\n   goshawk (A. Novae-Hollandiae) is pure white.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(33045, 'Gosherd', 'n.', 'One who takes care of geese.'),
(33046, 'Goslet', 'n.', 'One of several species of pygmy geese, of the genus\n   Nettepus. They are about the size of a teal, and inhabit Africa, India,\n   and Australia.'),
(33047, 'Gosling', 'n.', 'A young or unfledged goose.'),
(33048, 'Gosling', 'n.', 'A catkin on nut trees and pines.'),
(33049, 'Gospel', 'v.', 'Glad tidings; especially, the good news concerning Christ,\n   the Kingdom of God, and salvation.'),
(33050, 'Gospel', 'v.', 'One of the four narratives of the life and death of Jesus\n   Christ, written by Matthew, Mark, Luke, and John.'),
(33051, 'Gospel', 'v.', 'A selection from one of the gospels, for use in a religious\n   service; as, the gospel for the day.'),
(33052, 'Gospel', 'v.', 'Any system of religious doctrine; sometimes, any system of\n   political doctrine or social philosophy; as, this political gospel.'),
(33053, 'Gospel', 'v.', 'Anything propounded or accepted as infallibly true; as,\n   they took his words for gospel.'),
(33054, 'Gospel', 'a.', 'Accordant with, or relating to, the gospel; evangelical;\n   as, gospel righteousness.'),
(33055, 'Gospel', 'v. t.', 'To instruct in the gospel.'),
(33056, 'Gospeler', 'n.', 'One of the four evangelists.'),
(33057, 'Gospeler', 'n.', 'A follower of Wyclif, the first English religious\n   reformer; hence, a Puritan.'),
(33058, 'Gospeler', 'n.', 'A priest or deacon who reads the gospel at the altar\n   during the communion service.'),
(33059, 'Gossamer', 'n.', 'A fine, filmy substance, like cobwebs, floating in the\n   air, in calm, clear weather, especially in autumn. It is seen in\n   stubble fields and on furze or low bushes, and is formed by small\n   spiders.'),
(33060, 'Gossamer', 'n.', 'Any very thin gauzelike fabric; also, a thin waterproof\n   stuff.'),
(33061, 'Gossamer', 'n.', 'An outer garment, made of waterproof gossamer.'),
(33062, 'Gossan', 'n.', 'Decomposed rock, usually reddish or ferruginous (owing to\n   oxidized pyrites), forming the upper part of a metallic vein.'),
(33063, 'Gossat', 'n.', 'A small British marine fish (Motella tricirrata); -- called\n   also whistler and three-bearded rockling.'),
(33064, 'Gossib', 'n.', 'A gossip.'),
(33065, 'Gossip', 'n.', 'A sponsor; a godfather or a godmother.'),
(33066, 'Gossip', 'n.', 'A friend or comrade; a companion; a familiar and customary\n   acquaintance.'),
(33067, 'Gossip', 'n.', 'One who runs house to house, tattling and telling news; an\n   idle tattler.'),
(33068, 'Gossip', 'n.', 'The tattle of a gossip; groundless rumor.'),
(33069, 'Gossip', 'v. t.', 'To stand sponsor to.'),
(33070, 'Gossiped', 'imp. & p. p.', 'of Gossip'),
(33071, 'Gossip', 'v. i.', 'To make merry.'),
(33072, 'Gossip', 'v. i.', 'To prate; to chat; to talk much.'),
(33073, 'Gossip', 'v. i.', 'To run about and tattle; to tell idle tales.'),
(33074, 'Gossiper', 'n.', 'One given to gossip.'),
(33075, 'Gossipry', 'n.', 'Spiritual relationship or affinity; gossiprede; special\n   intimacy.'),
(33076, 'Gossipry', 'n.', 'Idle talk; gossip.'),
(33077, 'Gossipy', 'a.', 'Full of, or given to, gossip.'),
(33078, 'Gossoon', 'n.', 'A boy; a servant.'),
(33079, 'Goter', 'n.', 'a gutter.'),
(33080, 'Gothic', 'a.', 'Pertaining to the Goths; as, Gothic customs; also, rude;\n   barbarous.'),
(33081, 'Gothic', 'a.', 'Of or pertaining to a style of architecture with pointed\n   arches, steep roofs, windows large in proportion to the wall spaces,\n   and, generally, great height in proportion to the other dimensions --\n   prevalent in Western Europe from about 1200 to 1475 a. d. See Illust.\n   of Abacus, and Capital.'),
(33082, 'Gothic', 'n.', 'The language of the Goths; especially, the language of that\n   part of the Visigoths who settled in Moesia in the 4th century. See\n   Goth.'),
(33083, 'Gothic', 'n.', 'A kind of square-cut type, with no hair lines.'),
(33084, 'Gothic', 'n.', 'The style described in Gothic, a., 2.'),
(33085, 'Gothite', 'n.', 'Alt. of Goethite'),
(33086, 'Goethite', 'n.', 'A hydrous oxide of iron, occurring in prismatic crystals,\n   also massive, with a fibrous, reniform, or stalactitic structure. The\n   color varies from yellowish to blackish brown.'),
(33087, 'Gotten', '', 'p. p. of Get.'),
(33088, 'Gouache', 'n.', 'A method of painting with opaque colors, which have been\n   ground in water and mingled with a preparation of gum; also, a picture\n   thus painted.'),
(33089, 'Goudron', 'n.', 'a small fascine or fagot, steeped in wax, pitch, and glue,\n   used in various ways, as for igniting buildings or works, or to light\n   ditches and ramparts.'),
(33090, 'Gouge', 'n.', 'A chisel, with a hollow or semicylindrical blade, for\n   scooping or cutting holes, channels, or grooves, in wood, stone, etc.;\n   a similar instrument, with curved edge, for turning wood.'),
(33091, 'Gouge', 'n.', 'A bookbinder\'s tool for blind tooling or gilding, having a\n   face which forms a curve.'),
(33092, 'Gouge', 'n.', 'An incising tool which cuts forms or blanks for gloves,\n   envelopes, etc. from leather, paper, etc.'),
(33093, 'Gouge', 'n.', 'Soft material lying between the wall of a vein aud the solid\n   vein.'),
(33094, 'Gouge', 'n.', 'The act of scooping out with a gouge, or as with a gouge; a\n   groove or cavity scooped out, as with a gouge.'),
(33095, 'Gouge', 'n.', 'Imposition; cheat; fraud; also, an impostor; a cheat; a\n   trickish person.'),
(33096, 'Gouged', 'imp. & p. p.', 'of Bouge'),
(33097, 'Gouging', 'p. pr. & vb. n.', 'of Bouge'),
(33098, 'Bouge', 'v. t.', 'To scoop out with a gouge.'),
(33099, 'Bouge', 'v. t.', 'To scoop out, as an eye, with the thumb nail; to force\n   out the eye of (a person) with the thumb.'),
(33100, 'Bouge', 'v. t.', 'To cheat in a bargain; to chouse.'),
(33101, 'Gouger', 'n.', 'See Plum Gouger.'),
(33102, 'Goujere', 'n.', 'The venereal disease.'),
(33103, 'Gouland', 'n.', 'See Golding.'),
(33104, 'Goura', 'n.', 'One of several species of large, crested ground pigeons of\n   the genus Goura, inhabiting New Guinea and adjacent islands. The Queen\n   Victoria pigeon (Goura Victoria) and the crowned pigeon (G. coronata)\n   are among the beat known species.'),
(33105, 'Gourami', 'n.', 'A very largo East Indian freshwater fish (Osphromenus\n   gorami), extensively reared in artificial ponds in tropical countries,\n   and highly valued as a food fish. Many unsuccessful efforts have been\n   made to introduce it into Southern Europe.'),
(33106, 'Gourd', 'n.', 'A fleshy, three-celled, many-seeded fruit, as the melon,\n   pumpkin, cucumber, etc., of the order Cucurbitaceae; and especially the\n   bottle gourd (Lagenaria vulgaris) which occurs in a great variety of\n   forms, and, when the interior part is removed, serves for bottles,\n   dippers, cups, and other dishes.'),
(33107, 'Gourd', 'n.', 'A dipper or other vessel made from the shell of a gourd;\n   hence, a drinking vessel; a bottle.'),
(33108, 'Gourd', 'n.', 'A false die. See Gord.'),
(33109, 'Gourd', 'n.', 'Alt. of Gourde'),
(33110, 'Gourde', 'n.', 'A silver dollar; -- so called in Cuba, Hayti, etc.'),
(33111, 'Gourdy', 'a.', 'Swelled in the legs.'),
(33112, 'Gourmand', 'n.', 'A greedy or ravenous eater; a glutton. See Gormand.'),
(33113, 'Gourmet', 'n.', 'A connoisseur in eating and drinking; an epicure.'),
(33114, 'Gournet', 'n.', 'A fish. See Gurnet.'),
(33115, 'Goutily', 'adv.', 'In a gouty manner.'),
(33116, 'Goutweed', 'n.', 'Alt. of Goutwort'),
(33117, 'Goutwort', 'n.', 'A coarse umbelliferous plant of Europe (Aegopodium\n   Podagraria); -- called also bishop\'s weed, ashweed, and herb gerard.'),
(33118, 'Gouty', 'a.', 'Diseased with, or subject to, the gout; as, a gouty person;\n   a gouty joint.'),
(33119, 'Gouty', 'a.', 'Pertaining to the gout.'),
(33120, 'Gouty', 'a.', 'Swollen, as if from gout.'),
(33121, 'Gouty', 'a.', 'Boggy; as, gouty land.'),
(33122, 'Governed', 'imp. & p. p.', 'of Govern'),
(33123, 'Govern', 'v. t.', 'To direct and control, as the actions or conduct of men,\n   either by established laws or by arbitrary will; to regulate by\n   authority.'),
(33124, 'Govern', 'v. t.', 'To regulate; to influence; to direct; to restrain; to\n   manage; as, to govern the life; to govern a horse.'),
(33125, 'Govern', 'v. t.', 'To require to be in a particular case; as, a transitive\n   verb governs a noun in the objective case; or to require (a particular\n   case); as, a transitive verb governs the objective case.'),
(33126, 'Govern', 'v. i.', 'To exercise authority; to administer the laws; to have\n   the control.'),
(33127, 'Governal', 'n.', 'Alt. of Governail'),
(33128, 'Governor', 'n.', 'One who governs; especially, one who is invested with the\n   supreme executive authority in a State; a chief ruler or magistrate;\n   as, the governor of Pennsylvania.'),
(33129, 'Governor', 'n.', 'One who has the care or guardianship of a young man; a\n   tutor; a guardian.'),
(33130, 'Governor', 'n.', 'A pilot; a steersman.'),
(33131, 'Governor', 'n.', 'A contrivance applied to steam engines, water wheels, and\n   other machinery, to maintain nearly uniform speed when the resistances\n   and motive force are variable.'),
(33132, 'Gowan', 'n.', 'The daisy, or mountain daisy.'),
(33133, 'Gowan', 'n.', 'Decomposed granite.'),
(33134, 'Gowany', 'a.', 'Having, abounding in, or decked with, daisies.'),
(33135, 'Gowden', 'a.', 'Golden.'),
(33136, 'Gowdie', 'n.', 'See Dragont.'),
(33137, 'Gowdnook', 'n.', 'The saury pike; -- called also gofnick.'),
(33138, 'Gowned', 'p. a.', 'Dressed in a gown; clad.'),
(33139, 'Gownsman', 'n.', 'Alt. of Gownman'),
(33140, 'Gownman', 'n.', 'One whose professional habit is a gown, as a divine or\n   lawyer, and particularly a member of an English university; hence, a\n   civilian, in distinction from a soldier.'),
(33141, 'Gozzard', 'n.', 'See Gosherd.'),
(33142, 'Graafian', 'a.', 'Pertaining to, or discovered by, Regnier de Graaf, a\n   Dutch physician.'),
(33143, 'Graal', 'n.', 'See Grail., a dish.'),
(33144, 'Grabbed', 'imp. & p. p.', 'of Grab'),
(33145, 'Grabbing', 'p. pr. & vb. n.', 'of Grab'),
(33146, 'Grabber', 'n.', 'One who seizes or grabs.'),
(33147, 'Grabbled', 'imp. & p. p.', 'of Grabble'),
(33148, 'Grabble', 'v. i.', 'To grope; to feel with the hands.'),
(33149, 'Grabble', 'v. i.', 'To lie prostrate on the belly; to sprawl on the ground;\n   to grovel.'),
(33150, 'Grace', 'n.', 'The exercise of love, kindness, mercy, favor; disposition to\n   benefit or serve another; favor bestowed or privilege conferred.'),
(33151, 'Grace', 'n.', 'The divine favor toward man; the mercy of God, as\n   distinguished from His justice; also, any benefits His mercy imparts;\n   divine love or pardon; a state of acceptance with God; enjoyment of the\n   divine favor.'),
(33152, 'Grace', 'n.', 'The prerogative of mercy execised by the executive, as\n   pardon.'),
(33153, 'Grace', 'n.', 'The same prerogative when exercised in the form of equitable\n   relief through chancery.'),
(33154, 'Grace', 'n.', 'Fortune; luck; -- used commonly with hard or sorry when it\n   means misfortune.'),
(33155, 'Grace', 'n.', 'Inherent excellence; any endowment or characteristic fitted\n   to win favor or confer pleasure or benefit.'),
(33156, 'Grace', 'n.', 'Beauty, physical, intellectual, or moral; loveliness;\n   commonly, easy elegance of manners; perfection of form.'),
(33157, 'Grace', 'n.', 'Graceful and beautiful females, sister goddesses,\n   represented by ancient writers as the attendants sometimes of Apollo\n   but oftener of Venus. They were commonly mentioned as three in number;\n   namely, Aglaia, Euphrosyne, and Thalia, and were regarded as the\n   inspirers of the qualities which give attractiveness to wisdom, love,\n   and social intercourse.'),
(33158, 'Grace', 'n.', 'The title of a duke, a duchess, or an archbishop, and\n   formerly of the king of England.'),
(33159, 'Grace', 'n.', 'Thanks.'),
(33160, 'Grace', 'n.', 'A petition for grace; a blessing asked, or thanks rendered,\n   before or after a meal.'),
(33161, 'Grace', 'n.', 'Ornamental notes or short passages, either introduced by the\n   performer, or indicated by the composer, in which case the notation\n   signs are called grace notes, appeggiaturas, turns, etc.'),
(33162, 'Grace', 'n.', 'An act, vote, or decree of the government of the\n   institution; a degree or privilege conferred by such vote or decree.'),
(33163, 'Grace', 'n.', 'A play designed to promote or display grace of motion. It\n   consists in throwing a small hoop from one player to another, by means\n   of two sticks in the hands of each. Called also grace hoop or hoops.'),
(33164, 'Graced', 'imp. & p. p.', 'of Grace'),
(33165, 'Gracing', 'p. pr. & vb. n.', 'of Grace'),
(33166, 'Grace', 'v. t.', 'To adorn; to decorate; to embellish and dignify.'),
(33167, 'Grace', 'v. t.', 'To dignify or raise by an act of favor; to honor.'),
(33168, 'Grace', 'v. t.', 'To supply with heavenly grace.'),
(33169, 'Grace', 'v. t.', 'To add grace notes, cadenzas, etc., to.'),
(33170, 'Graced', 'a.', 'Endowed with grace; beautiful; full of graces; honorable.'),
(33171, 'Graceful', 'a.', 'Displaying grace or beauty in form or action; elegant;\n   easy; agreeable in appearance; as, a graceful walk, deportment,\n   speaker, air, act, speech.'),
(33172, 'Gracile', 'a.', 'Alt. of Gracillent'),
(33173, 'Gracious', 'a.', 'Abounding in grace or mercy; manifesting love,. or\n   bestowing mercy; characterized by grace; beneficent; merciful; disposed\n   to show kindness or favor; condescending; as, his most gracious\n   majesty.'),
(33174, 'Gracious', 'a.', 'Abounding in beauty, loveliness, or amiability; graceful;\n   excellent.'),
(33175, 'Gracious', 'a.', 'Produced by divine grace; influenced or controlled by the\n   divine influence; as, gracious affections.'),
(33176, 'Grackle', 'n.', 'One of several American blackbirds, of the family\n   Icteridae; as, the rusty grackle (Scolecophagus Carolinus); the\n   boat-tailed grackle (see Boat-tail); the purple grackle (Quiscalus\n   quiscula, or Q. versicolor). See Crow blackbird, under Crow.'),
(33177, 'Grackle', 'n.', 'An Asiatic bird of the genus Gracula. See Myna.'),
(33178, 'Gradate', 'v. t.', 'To grade or arrange (parts in a whole, colors in\n   painting, etc.), so that they shall harmonize.'),
(33179, 'Gradate', 'v. t.', 'To bring to a certain strength or grade of\n   concentration; as, to gradate a saline solution.'),
(33180, 'Grade', 'n.', 'A step or degree in any series, rank, quality, order;\n   relative position or standing; as, grades of military rank; crimes of\n   every grade; grades of flour.'),
(33181, 'Grade', 'n.', 'The rate of ascent or descent; gradient; deviation from a\n   level surface to an inclined plane; -- usually stated as so many feet\n   per mile, or as one foot rise or fall in so many of horizontal\n   distance; as, a heavy grade; a grade of twenty feet per mile, or of 1\n   in 264.'),
(33182, 'Grade', 'n.', 'A graded ascending, descending, or level portion of a road;\n   a gradient.'),
(33183, 'Grade', 'n.', 'The result of crossing a native stock with some better\n   breed. If the crossbreed have more than three fourths of the better\n   blood, it is called high grade.'),
(33184, 'Graded', 'imp. & p. p.', 'of Grade'),
(33185, 'Grading', 'p. pr. & vb. n.', 'of Grade'),
(33186, 'Grade', 'v. t.', 'To arrange in order, steps, or degrees, according to\n   size, quality, rank, etc.'),
(33187, 'Grade', 'v. t.', 'To reduce to a level, or to an evenly progressive ascent,\n   as the line of a canal or road.'),
(33188, 'Grade', 'v. t.', 'To cross with some better breed; to improve the blood of.'),
(33189, 'Gradely', 'a.', 'Decent; orderly.'),
(33190, 'Gradely', 'adv.', 'Decently; in order.'),
(33191, 'Grader', 'n.', 'One who grades, or that by means of which grading is done\n   or facilitated.'),
(33192, 'Gradient', 'a.', 'Moving by steps; walking; as, gradient automata.'),
(33193, 'Gradient', 'a.', 'Rising or descending by regular degrees of inclination;\n   as, the gradient line of a railroad.'),
(33194, 'Gradient', 'a.', 'Adapted for walking, as the feet of certain birds.'),
(33195, 'Gradient', 'n.', 'The rate of regular or graded ascent or descent in a\n   road; grade.'),
(33196, 'Gradient', 'n.', 'A part of a road which slopes upward or downward; a\n   portion of a way not level; a grade.'),
(33197, 'Gradient', 'n.', 'The rate of increase or decrease of a variable magnitude,\n   or the curve which represents it; as, a thermometric gradient.'),
(33198, 'Gradin', 'n.', 'Alt. of Gradine'),
(33199, 'Gradine', 'n.', 'Any member like a step, as the raised back of an altar or\n   the like; a set raised over another.'),
(33200, 'Gradine', 'n.', 'A toothed chised by sculptors.'),
(33201, 'Grading', 'n.', 'The act or method of arranging in or by grade, or of\n   bringing, as the surface of land or a road, to the desired level or\n   grade.'),
(33202, 'Gradinos', 'pl. ', 'of Gradino'),
(33203, 'Gradino', 'n.', 'A step or raised shelf, as above a sideboard or altar. Cf.\n   Superaltar, and Gradin.'),
(33204, 'Gradual', 'n.', 'Proceeding by steps or degrees; advancing, step by step,\n   as in ascent or descent or from one state to another; regularly\n   progressive; slow; as, a gradual increase of knowledge; a gradual\n   decline.'),
(33205, 'Gradual', 'n.', 'An antiphon or responsory after the epistle, in the Mass,\n   which was sung on the steps, or while the deacon ascended the steps.'),
(33206, 'Gradual', 'n.', 'A service book containing the musical portions of the\n   Mass.'),
(33207, 'Gradual', 'n.', 'A series of steps.'),
(33208, 'Graduate', 'n.', 'To mark with degrees; to divide into regular steps,\n   grades, or intervals, as the scale of a thermometer, a scheme of\n   punishment or rewards, etc.'),
(33209, 'Graduate', 'n.', 'To admit or elevate to a certain grade or degree; esp.,\n   in a college or university, to admit, at the close of the course, to an\n   honorable standing defined by a diploma; as, he was graduated at Yale\n   College.'),
(33210, 'Graduate', 'n.', 'To prepare gradually; to arrange, temper, or modify by\n   degrees or to a certain degree; to determine the degrees of; as, to\n   graduate the heat of an oven.'),
(33211, 'Graduate', 'n.', 'To bring to a certain degree of consistency, by\n   evaporation, as a fluid.'),
(33212, 'Graduate', 'v. i.', 'To pass by degrees; to change gradually; to shade off;\n   as, sandstone which graduates into gneiss; carnelian sometimes\n   graduates into quartz.'),
(33213, 'Graduate', 'v. i.', 'To taper, as the tail of certain birds.'),
(33214, 'Graduate', 'v. i.', 'To take a degree in a college or university; to become\n   a graduate; to receive a diploma.'),
(33215, 'Graduate', 'n.', 'One who has received an academical or professional\n   degree; one who has completed the prescribed course of study in any\n   school or institution of learning.'),
(33216, 'Graduate', 'n.', 'A graduated cup, tube, or flask; a measuring glass used\n   by apothecaries and chemists. See under Graduated.'),
(33217, 'Graduate', 'n. & v.', 'Arranged by successive steps or degrees; graduated.'),
(33218, 'Gradus', 'n.', 'A dictionary of prosody, designed as an aid in writing\n   Greek or Latin poetry.'),
(33219, 'Graff', 'n.', 'A steward; an overseer.'),
(33220, 'Graff', 'n. & v.', 'See Graft.'),
(33221, 'Graffage', 'n.', 'The scarp of a ditch or moat.'),
(33222, 'Graffer', 'n.', 'a notary or scrivener.'),
(33223, 'Graffiti', 'n. pl.', 'Inscriptions, figure drawings, etc., found on the\n   walls of ancient sepulchers or ruins, as in the Catacombs, or at\n   Pompeii.'),
(33224, 'Graft', 'n.', 'A small shoot or scion of a tree inserted in another tree,\n   the stock of which is to support and nourish it. The two unite and\n   become one tree, but the graft determines the kind of fruit.'),
(33225, 'Graft', 'n.', 'A branch or portion of a tree growing from such a shoot.'),
(33226, 'Graft', 'n.', 'A portion of living tissue used in the operation of\n   autoplasty.'),
(33227, 'Grafted', 'imp. & p. p.', 'of Graft'),
(33228, 'Grafting', 'p. pr. & vb. n.', 'of Graft'),
(33229, 'Graft', 'n.', 'To insert (a graft) in a branch or stem of another tree; to\n   propagate by insertion in another stock; also, to insert a graft upon.'),
(33230, 'Graft', 'n.', 'To implant a portion of (living flesh or akin) in a lesion\n   so as to form an organic union.'),
(33231, 'Graft', 'n.', 'To join (one thing) to another as if by grafting, so as to\n   bring about a close union.'),
(33232, 'Graft', 'n.', 'To cover, as a ring bolt, block strap, splicing, etc., with\n   a weaving of small cord or rope-yarns.'),
(33233, 'Graft', 'v. i.', 'To insert scions from one tree, or kind of tree, etc.,\n   into another; to practice grafting.'),
(33234, 'Grafter', 'n.', 'One who inserts scions on other stocks, or propagates\n   fruit by ingrafting.'),
(33235, 'Grafter', 'n.', 'An instrument by which grafting is facilitated.'),
(33236, 'Grafter', 'n.', 'The original tree from which a scion has been taken for\n   grafting upon another tree.'),
(33237, 'Grafting', 'n.', 'The act or method of weaving a cover for a ring, rope\n   end, etc.'),
(33238, 'Grafting', 'n.', 'The transplanting of a portion of flesh or skin to a\n   denuded surface; autoplasty.'),
(33239, 'Grafting', 'n.', 'A scarfing or endwise attachment of one timber to\n   another.'),
(33240, 'Grail', 'n.', 'A book of offices in the Roman Catholic Church; a gradual.'),
(33241, 'Grail', 'n.', 'A broad, open dish; a chalice; -- only used of the Holy\n   Grail.'),
(33242, 'Grail', 'n.', 'Small particles of earth; gravel.'),
(33243, 'Grail', 'n.', 'One of the small feathers of a hawk.'),
(33244, 'Graille', 'n.', 'A halfround single-cut file or fioat, having one curved\n   face and one straight face, -- used by comb makers.'),
(33245, 'Grain', 'v. & n.', 'See Groan.'),
(33246, 'Grain', 'n.', 'A single small hard seed; a kernel, especially of those\n   plants, like wheat, whose seeds are used for food.'),
(33247, 'Grain', 'n.', 'The fruit of certain grasses which furnish the chief food of\n   man, as corn, wheat, rye, oats, etc., or the plants themselves; -- used\n   collectively.'),
(33248, 'Grain', 'n.', 'Any small, hard particle, as of sand, sugar, salt, etc.;\n   hence, any minute portion or particle; as, a grain of gunpowder, of\n   pollen, of starch, of sense, of wit, etc.'),
(33249, 'Grain', 'n.', 'The unit of the English system of weights; -- so called\n   because considered equal to the average of grains taken from the middle\n   of the ears of wheat. 7,000 grains constitute the pound avoirdupois,\n   and 5,760 grains the pound troy. A grain is equal to .0648 gram. See\n   Gram.'),
(33250, 'Grain', 'n.', 'A reddish dye made from the coccus insect, or kermes; hence,\n   a red color of any tint or hue, as crimson, scarlet, etc.; sometimes\n   used by the poets as equivalent to Tyrian purple.'),
(33251, 'Grain', 'n.', 'The composite particles of any substance; that arrangement\n   of the particles of any body which determines its comparative roughness\n   or hardness; texture; as, marble, sugar, sandstone, etc., of fine\n   grain.'),
(33252, 'Grain', 'n.', 'The direction, arrangement, or appearance of the fibers in\n   wood, or of the strata in stone, slate, etc.'),
(33253, 'Grain', 'n.', 'The fiber which forms the substance of wood or of any\n   fibrous material.'),
(33254, 'Grain', 'n.', 'The hair side of a piece of leather, or the marking on that\n   side.'),
(33255, 'Grain', 'n.', 'The remains of grain, etc., after brewing or distillation;\n   hence, any residuum. Also called draff.'),
(33256, 'Grain', 'n.', 'A rounded prominence on the back of a sepal, as in the\n   common dock. See Grained, a., 4.'),
(33257, 'Grain', 'a.', 'Temper; natural disposition; inclination.'),
(33258, 'Grain', 'a.', 'A sort of spice, the grain of paradise.'),
(33259, 'Grained', 'imp. & p. p.', 'of Grain'),
(33260, 'Grain', 'v. t.', 'To paint in imitation of the grain of wood, marble, etc.'),
(33261, 'Grain', 'v. t.', 'To form (powder, sugar, etc.) into grains.'),
(33262, 'Grain', 'v. t.', 'To take the hair off (skins); to soften and raise the\n   grain of (leather, etc.).'),
(33263, 'Grain', 'n.', 'To yield fruit.'),
(33264, 'Grain', 'n.', 'To form grains, or to assume a granular ferm, as the result\n   of crystallization; to granulate.'),
(33265, 'Grain', 'n.', 'A branch of a tree; a stalk or stem of a plant.'),
(33266, 'Grain', 'n.', 'A tine, prong, or fork.'),
(33267, 'Grain', 'n.', 'One the branches of a valley or of a river.'),
(33268, 'Grain', 'n.', 'An iron first speak or harpoon, having four or more barbed\n   points.'),
(33269, 'Grain', 'n.', 'A blade of a sword, knife, etc.'),
(33270, 'Grain', 'n.', 'A thin piece of metal, used in a mold to steady a core.'),
(33271, 'Grained', 'a.', 'Having a grain; divided into small particles or grains;\n   showing the grain; hence, rough.'),
(33272, 'Grained', 'a.', 'Dyed in grain; ingrained.'),
(33273, 'Grained', 'a.', 'Painted or stained in imitation of the grain of wood,\n   marble, etc.'),
(33274, 'Grained', 'a.', 'Having tubercles or grainlike processes, as the petals or\n   sepals of some flowers.'),
(33275, 'Grainer', 'n.', 'An infusion of pigeon\'s dung used by tanners to neutralize\n   the effects of lime and give flexibility to skins; -- called also\n   grains and bate.'),
(33276, 'Grainer', 'n.', 'A knife for taking the hair off skins.'),
(33277, 'Grainer', 'n.', 'One who paints in imitation of the grain of wood, marble,\n   etc.; also, the brush or tool used in graining.'),
(33278, 'Graining', 'n.', 'Indentation; roughening; milling, as on edges of coins.'),
(33279, 'Graining', 'n.', 'A process in dressing leather, by which the skin is\n   softened and the grain raised.'),
(33280, 'Graining', 'n.', 'Painting or staining, in imitation of the grain of wood,\n   atone, etc.'),
(33281, 'Graining', 'n.', 'The process of separating soap from spent lye, as with\n   salt.'),
(33282, 'Graining', 'n.', 'A small European fresh-water fish (Leuciscus vulgaris); -\n   called also dobule, and dace.'),
(33283, 'Grains', 'n. pl.', 'See 5th Grain, n., 2 (b).'),
(33284, 'Grains', 'n.', 'Pigeon\'s dung used in tanning. See Grainer. n., 1.'),
(33285, 'Grainy', 'a.', 'Resembling grains; granular.'),
(33286, 'Graip', 'n.', 'A dungfork.'),
(33287, 'Graith', 'v. t.', 'See Greith.'),
(33288, 'Graith', 'n.', 'Furniture; apparatus or accouterments for work, traveling,\n   war, etc.'),
(33289, 'Grakle', 'n.', 'See Grackle.'),
(33290, 'Grallae', 'n. pl.', 'An order of birds which formerly included all the\n   waders. By later writers it is usually restricted to the sandpipers,\n   plovers, and allied forms; -- called also Grallatores.'),
(33291, 'Grallic', 'a.', 'Pertaining to the Grallae.'),
(33292, 'Gralline', 'a.', 'Of or pertaining to the Grallae.'),
(33293, 'Gralloch', 'n.', 'Offal of a deer.'),
(33294, 'Gralloch', 'v. t.', 'To remove the offal from (a deer).'),
(33295, '-gram', '', 'A suffix indicating something drawn or written, a drawing,\n   writing; -- as, monogram, telegram, chronogram.'),
(33296, 'Gramme', 'n.', 'The unit of weight in the metric system. It was intended to\n   be exactly, and is very nearly, equivalent to the weight in a vacuum of\n   one cubic centimeter of pure water at its maximum density. It is equal\n   to 15.432 grains. See Grain, n., 4.'),
(33297, 'Gramarye', 'n.', 'Necromancy; magic.'),
(33298, 'Grame', 'a.', 'Anger; wrath; scorn.'),
(33299, 'Grame', 'a.', 'Sorrow; grief; misery.'),
(33300, 'Gramercy', 'interj.', 'A word formerly used to express thankfulness, with\n   surprise; many thanks.'),
(33301, 'Grammar', 'n.', 'The science which treats of the principles of language;\n   the study of forms of speech, and their relations to one another; the\n   art concerned with the right use aud application of the rules of a\n   language, in speaking or writing.'),
(33302, 'Grammar', 'n.', 'The art of speaking or writing with correctness or\n   according to established usage; speech considered with regard to the\n   rules of a grammar.'),
(33303, 'Grammar', 'n.', 'A treatise on the principles of language; a book\n   containing the principles and rules for correctness in speaking or\n   writing.'),
(33304, 'Grammar', 'n.', 'treatise on the elements or principles of any science; as,\n   a grammar of geography.'),
(33305, 'Grammar', 'v. i.', 'To discourse according to the rules of grammar; to use\n   grammar.'),
(33306, 'Gramme', 'n.', 'Same as Gram the weight.'),
(33307, 'Grampus', 'n.', 'A toothed delphinoid cetacean, of the genus Grampus, esp.\n   G. griseus of Europe and America, which is valued for its oil. It grows\n   to be fifteen to twenty feet long; its color is gray with white\n   streaks. Called also cowfish. The California grampus is G. Stearnsii.'),
(33308, 'Grampus', 'n.', 'A kind of tongs used in a bloomery.'),
(33309, 'Granade', 'n.', 'Alt. of Granado'),
(33310, 'Granado', 'n.', 'See Grenade.'),
(33311, 'Granary', 'n.', 'A storehouse or repository for grain, esp. after it is\n   thrashed or husked; a cornbouse; also (Fig.), a region fertile in\n   grain.'),
(33312, 'Granate', 'n.', 'See Garnet.'),
(33313, 'Granatin', 'n.', 'Mannite; -- so called because found in the pomegranate.'),
(33314, 'Grand', 'superl.', 'Of large size or extent; great; extensive; hence,\n   relatively great; greatest; chief; principal; as, a grand mountain; a\n   grand army; a grand mistake.'),
(33315, 'Grand', 'superl.', 'Great in size, and fine or imposing in appearance or\n   impression; illustrious, dignifled, or noble (said of persons);\n   majestic, splendid, magnificent, or sublime (said of things); as, a\n   grand monarch; a grand lord; a grand general; a grand view; a grand\n   conception.'),
(33316, 'Grand', 'superl.', 'Having higher rank or more dignity, size, or importance\n   than other persons or things of the same name; as, a grand lodge; a\n   grand vizier; a grand piano, etc.'),
(33317, 'Grand', 'superl.', 'Standing in the second or some more remote degree of\n   parentage or descent; -- generalIy used in composition; as,\n   grandfather, grandson, grandchild, etc.'),
(33318, 'Grandam', 'n.', 'An old woman; specifically, a grandmother.'),
(33319, 'Grandee', 'n.', 'A man of elevated rank or station; a nobleman. In Spain, a\n   nobleman of the first rank, who may be covered in the king\'s presence.'),
(33320, 'Grandeur', 'n.', 'The state or quality of being grand; vastness; greatness;\n   splendor; magnificence; stateliness; sublimity; dignity; elevation of\n   thought or expression; nobility of action.'),
(33321, 'Grandity', 'n.', 'Grandness.'),
(33322, 'Grandly', 'adv.', 'In a grand manner.'),
(33323, 'Grandma', 'n.', 'Alt. of Grandmamma'),
(33324, 'Grandpa', 'n.', 'Alt. of Grandpapa'),
(33325, 'Grandson', 'n.', 'A son\'s or daughter\'s son.'),
(33326, 'Grane', 'v. & n.', 'See Groan.'),
(33327, 'Grange', 'n.', 'A building for storing grain; a granary.'),
(33328, 'Grange', 'n.', 'A farmhouse, with the barns and other buildings for farming\n   purposes.'),
(33329, 'Grange', 'n.', 'A farmhouse of a monastery, where the rents and tithes,\n   paid in grain, were deposited.'),
(33330, 'Grange', 'n.', 'A farm; generally, a farm with a house at a distance from\n   neighbors.'),
(33331, 'Grange', 'n.', 'An association of farmers, designed to further their\n   interests, aud particularly to bring producers and consumers, farmers\n   and manufacturers, into direct commercial relations, without\n   intervention of middlemen or traders. The first grange was organized in\n   1867.'),
(33332, 'Granger', 'n.', 'A farm steward.'),
(33333, 'Granger', 'n.', 'A member of a grange.'),
(33334, 'Granilla', 'n.', 'Small grains or dust of cochineal or the coccus insect.'),
(33335, 'Granite', 'n.', 'A crystalline, granular rock, consisting of quartz,\n   feldspar, and mica, and usually of a whitish, grayish, or flesh-red\n   color. It differs from gneiss in not having the mica in planes, and\n   therefore in being destitute of a schistose structure.'),
(33336, 'Granitic', 'a.', 'Like granite in composition, color, etc.; having the\n   nature of granite; as, granitic texture.'),
(33337, 'Granitic', 'a.', 'Consisting of granite; as, granitic mountains.'),
(33338, 'Grannam', 'n.', 'A grandam.'),
(33339, 'Granny', 'n.', 'A grandmother; a grandam; familiarly, an old woman.'),
(33340, 'Granted', 'imp. & p. p.', 'of Grant'),
(33341, 'Granting', 'p. pr. & vb. n.', 'of Grant'),
(33342, 'Grant', 'v. t.', 'To give over; to make conveyance of; to give the\n   possession or title of; to convey; -- usually in answer to petition.'),
(33343, 'Grant', 'v. t.', 'To bestow or confer, with or without compensation,\n   particularly in answer to prayer or request; to give.'),
(33344, 'Grant', 'v. t.', 'To admit as true what is not yet satisfactorily proved;\n   to yield belief to; to allow; to yield; to concede.'),
(33345, 'Grant', 'v. i.', 'To assent; to consent.'),
(33346, 'Grant', 'v. t.', 'The act of granting; a bestowing or conferring;\n   concession; allowance; permission.'),
(33347, 'Grant', 'v. t.', 'The yielding or admission of something in dispute.'),
(33348, 'Grant', 'v. t.', 'The thing or property granted; a gift; a boon.'),
(33349, 'Grant', 'v. t.', 'A transfer of property by deed or writing; especially, au\n   appropriation or conveyance made by the government; as, a grant of land\n   or of money; also, the deed or writing by which the transfer is made.'),
(33350, 'Grantee', 'n.', 'The person to whom a grant or conveyance is made.'),
(33351, 'Granter', 'n.', 'One who grants.'),
(33352, 'Grantor', 'n.', 'The person by whom a grant or conveyance is made.'),
(33353, 'Granular', 'a.', 'Consisting of, or resembling, grains; as, a granular\n   substance.'),
(33354, 'Granule', 'n.', 'A little grain a small particle; a pellet.'),
(33355, 'Grape', 'n.', 'A well-known edible berry growing in pendent clusters or\n   bunches on the grapevine. The berries are smooth-skinned, have a juicy\n   pulp, and are cultivated in great quantities for table use and for\n   making wine and raisins.'),
(33356, 'Grape', 'n.', 'The plant which bears this fruit; the grapevine.'),
(33357, 'Grape', 'n.', 'A mangy tumor on the leg of a horse.'),
(33358, 'Grape', 'n.', 'Grapeshot.'),
(33359, 'Grapery', 'n.', 'A building or inclosure used for the cultivation of\n   grapes.'),
(33360, 'Graphic', 'a.', 'Alt. of Graphical'),
(33361, 'Graphics', 'n.', 'The art or the science of drawing; esp. of drawing\n   according to mathematical rules, as in perspective, projection, and the\n   like.'),
(33362, 'Graphite', 'n.', 'Native carbon in hexagonal crystals, also foliated or\n   granular massive, of black color and metallic luster, and so soft as to\n   leave a trace on paper. It is used for pencils (improperly called lead\n   pencils), for crucibles, and as a lubricator, etc. Often called\n   plumbago or black lead.'),
(33363, '-graphy', '', 'A suffix denoting the art of writing or describing; also,\n   the writing or description itself; a treatise; as, calligraphy,\n   biography, geography.'),
(33364, 'Grapnel', 'n.', 'A small anchor, with four or five flukes or claws, used to\n   hold boats or small vessels; hence, any instrument designed to grapple\n   or hold; a grappling iron; a grab; -- written also grapline, and\n   crapnel.'),
(33365, 'Grappled', 'imp. & p. p.', 'of Grapple'),
(33366, 'Grapple', 'v. t.', 'To seize; to lay fast hold of; to attack at close\n   quarters: as, to grapple an antagonist.'),
(33367, 'Grapple', 'v. t.', 'To fasten, as with a grapple; to fix; to join\n   indissolubly.'),
(33368, 'Grapple', 'v. i.', 'To use a grapple; to contend in close fight; to attach\n   one\'s self as if by a grapple, as in wrestling; to close; to seize one\n   another.'),
(33369, 'Grapple', 'v. t.', 'A seizing or seizure; close hug in contest; the\n   wrestler\'s hold.'),
(33370, 'Grapple', 'v. t.', 'An instrument, usually with hinged claws, for seizing\n   and holding fast to an object; a grab.'),
(33371, 'Grapple', 'v. t.', 'A grappling iron.'),
(33372, 'Grapsoid', 'a.', 'Pertaining to the genus Grapsus or the family Grapsidae.'),
(33373, 'Grapsoid', 'n.', 'A grapsoid crab.'),
(33374, 'Grapy', 'a.', 'Composed of, or resembling, grapes.'),
(33375, 'Grasper', 'imp. & p. p.', 'of Grasp'),
(33376, 'Qraspine', 'p. pr. & vb. n.', 'of Grasp'),
(33377, 'Grasp', 'v. t.', 'To seize and hold by clasping or embracing with the\n   fingers or arms; to catch to take possession of.'),
(33378, 'Grasp', 'v. t.', 'To lay hold of with the mind; to become thoroughly\n   acquainted or conversant with; to comprehend.'),
(33379, 'Grasp', 'v. i.', 'To effect a grasp; to make the motion of grasping; to\n   clutch; to struggle; to strive.'),
(33380, 'Grasp', 'n.', 'A gripe or seizure of the hand; a seizure by embrace, or\n   infolding in the arms.'),
(33381, 'Grasp', 'n.', 'Reach of the arms; hence, the power of seizing and holding;\n   as, it was beyond his grasp.'),
(33382, 'Grasp', 'n.', 'Forcible possession; hold.'),
(33383, 'Grasp', 'n.', 'Wide-reaching power of intellect to comprehend subjects and\n   hold them under survey.'),
(33384, 'Grasp', 'n.', 'The handle of a sword or of an oar.'),
(33385, 'Graaper', 'n.', 'One who grasps or seizes; one who catches or holds.'),
(33386, 'Grasping', 'a.', 'Seizing; embracing; catching.'),
(33387, 'Grasping', 'a.', 'Avaricious; greedy of gain; covetous; close; miserly; as,\n   he is a grasping man.'),
(33388, 'Grass', 'n.', 'Popularly: Herbage; the plants which constitute the food of\n   cattle and other beasts; pasture.'),
(33389, 'Grass', 'n.', 'An endogenous plant having simple leaves, a stem generally\n   jointed and tubular, the husks or glumes in pairs, and the seed single.'),
(33390, 'Grass', 'n.', 'The season of fresh grass; spring.'),
(33391, 'Grass', 'n.', 'Metaphorically used for what is transitory.'),
(33392, 'Grassed', 'imp. & p. p.', 'of Grass'),
(33393, 'Grassing', 'p. pr. & vb. n.', 'of Grass'),
(33394, 'Grass', 'v. t.', 'To cover with grass or with turf.'),
(33395, 'Grass', 'v. t.', 'To expose, as flax, on the grass for bleaching, etc.'),
(33396, 'Grass', 'v. t.', 'To bring to the grass or ground; to land; as, to grass a\n   fish.'),
(33397, 'Grass', 'v. i.', 'To produce grass.'),
(33398, 'Grassy', 'a.', 'Covered with grass; abounding with grass; as, a grassy\n   lawn.'),
(33399, 'Grassy', 'a.', 'Resembling grass; green.'),
(33400, 'Grate', 'a.', 'Serving to gratify; agreeable.'),
(33401, 'Grate', 'n.', 'A structure or frame containing parallel or crosed bars,\n   with interstices; a kind of latticework, such as is used ia the windows\n   of prisons and cloisters.'),
(33402, 'Grate', 'n.', 'A frame or bed, or kind of basket, of iron bars, for holding\n   fuel while burning.'),
(33403, 'Grated', 'imp. & p. p.', 'of Grate'),
(33404, 'Grating', 'p. pr. &. vb. n.', 'of Grate'),
(33405, 'Grate', 'v. t.', 'To furnish with grates; to protect with a grating or\n   crossbars; as, to grate a window.'),
(33406, 'Grate', 'v. t.', 'To rub roughly or harshly, as one body against another,\n   causing a harsh sound; as, to grate the teeth; to produce (a harsh\n   sound) by rubbing.'),
(33407, 'Grate', 'v. t.', 'To reduce to small particles by rubbing with anything\n   rough or indented; as, to grate a nutmeg.'),
(33408, 'Grate', 'v. t.', 'To fret; to irritate; to offend.'),
(33409, 'Grate', 'v. i.', 'To make a harsh sound by friction.'),
(33410, 'Grate', 'v. i.', 'To produce the effect of rubbing with a hard rough\n   material; to cause wearing, tearing, or bruising. Hence; To produce\n   exasperation, soreness, or grief; to offend by oppression or\n   importunity.'),
(33411, 'Grated', 'a.', 'Furnished with a grate or grating; as, grated windows.'),
(33412, 'Grateful', 'a.', 'Having a due sense of benefits received; kindly disposed\n   toward one from whom a favor has been received; willing to acknowledge\n   and repay, or give thanks for, benefits; as, a grateful heart.'),
(33413, 'Grateful', 'a.', 'Affording pleasure; pleasing to the senses; gratifying;\n   delicious; as, a grateful present; food grateful to the palate;\n   grateful sleep.'),
(33414, 'Grater', 'a.', 'One who, or that which, grates; especially, an instrument\n   or utensil with a rough, indented surface, for rubbing off small\n   particles of any substance; as a grater for nutmegs.'),
(33415, 'Gratify', 'v. t.', 'To please; to give pleasure to; to satisfy; to soothe;\n   to indulge; as, to gratify the taste, the appetite, the senses, the\n   desires, the mind, etc.'),
(33416, 'Gratify', 'v. t.', 'To requite; to recompense.'),
(33417, 'Grating', 'n.', 'A partition, covering, or frame of parallel or cross bars;\n   a latticework resembling a window grate; as, the grating of a prison or\n   convent.'),
(33418, 'Grating', 'n.', 'A system of close equidistant and parallel lines lines or\n   bars, especially lines ruled on a polished surface, used for producing\n   spectra by diffraction; -- called also diffraction grating.'),
(33419, 'Grating', 'n.', 'The strong wooden lattice used to cover a hatch, admitting\n   light and air; also, a movable Lattice used for the flooring of boats.'),
(33420, 'Grating', 'a.', 'That grates; making a harsh sound; harsh.'),
(33421, 'Grating', 'n.', 'A harsh sound caused by attrition.'),
(33422, 'Gratis', 'adv.', 'For nothing; without fee or recompense; freely;\n   gratuitously.'),
(33423, 'Gratuity', 'n.', 'Something given freely or without recompense; a free\n   gift; a present.'),
(33424, 'Gratuity', 'n.', 'Something voluntarily given in return for a favor or\n   service, as a recompense or acknowledgment.'),
(33425, 'Graunt', 'v. & n.', 'See Grant.'),
(33426, 'Gravamen', 'a.', 'The grievance complained of; the substantial cause of the\n   action; also, in general, the ground or essence of a complaint.\n   Bouvier.'),
(33427, '-grave', '', 'A final syllable signifying a ruler, as in landgrave,\n   margrave. See Margrave.'),
(33428, 'Grave', 'v. t.', 'To clean, as a vessel\'s bottom, of barnacles, grass,\n   etc., and pay it over with pitch; -- so called because graves or\n   greaves was formerly used for this purpose.'),
(33429, 'Grave', 'superl.', 'Of great weight; heavy; ponderous.'),
(33430, 'Grave', 'superl.', 'Of importance; momentous; weighty; influential; sedate;\n   serious; -- said of character, relations, etc.; as, grave deportment,\n   character, influence, etc.'),
(33431, 'Grave', 'superl.', 'Not light or gay; solemn; sober; plain; as, a grave\n   color; a grave face.'),
(33432, 'Grave', 'superl.', 'Not acute or sharp; low; deep; -- said of sound; as, a\n   grave note or key.'),
(33433, 'Grave', 'superl.', 'Slow and solemn in movement.'),
(33434, 'Graved', 'imp.', 'of Grave'),
(33435, 'Graven', 'p. p.', 'of Grave'),
(33436, 'Graved', '', 'of Grave'),
(33437, 'Graving', 'p. pr. & vb. n.', 'of Grave'),
(33438, 'Grave', 'n.', 'To dig. [Obs.] Chaucer.'),
(33439, 'Grave', 'n.', 'To carve or cut, as letters or figures, on some hard\n   substance; to engrave.'),
(33440, 'Grave', 'n.', 'To carve out or give shape to, by cutting with a chisel; to\n   sculpture; as, to grave an image.'),
(33441, 'Grave', 'n.', 'To impress deeply (on the mind); to fix indelibly.'),
(33442, 'Grave', 'n.', 'To entomb; to bury.'),
(33443, 'Grave', 'v. i.', 'To write or delineate on hard substances, by means of\n   incised lines; to practice engraving.'),
(33444, 'Grave', 'n.', 'An excavation in the earth as a place of burial; also, any\n   place of interment; a tomb; a sepulcher. Hence: Death; destruction.'),
(33445, 'Gravel', 'n.', 'Small stones, or fragments of stone; very small pebbles,\n   often intermixed with particles of sand.'),
(33446, 'Gravel', 'n.', 'A deposit of small calculous concretions in the kidneys and\n   the urinary or gall bladder; also, the disease of which they are a\n   symptom.'),
(33447, 'Graveled', 'imp. & p. p.', 'of Gravel'),
(33448, 'Gravel', 'v. t.', 'To cover with gravel; as, to gravel a walk.'),
(33449, 'Gravel', 'v. t.', 'To run (as a ship) upon the gravel or beach; to run\n   aground; to cause to stick fast in gravel or sand.'),
(33450, 'Gravel', 'v. t.', 'To check or stop; to embarrass; to perplex.'),
(33451, 'Gravel', 'v. t.', 'To hurt or lame (a horse) by gravel lodged between the\n   shoe and foot.'),
(33452, 'Gravelly', 'a.', 'Abounding with gravel; consisting of gravel; as, a\n   gravelly soil.'),
(33453, 'Gravely', 'adv.', 'In a grave manner.'),
(33454, 'Graven', 'v. t.', 'Carved.'),
(33455, 'Graver', 'n.', 'One who graves; an engraver or a sculptor; one whose\n   occupation is te cut letters or figures in stone or other hard\n   material.'),
(33456, 'Graver', 'n.', 'An ergraving or cutting tool; a burin.'),
(33457, 'Gravery', 'n.', 'The act, process, or art, of graving or carving;\n   engraving.'),
(33458, 'Graves', 'n. pl.', 'The sediment of melted tallow. Same as Greaves.'),
(33459, 'Gravic', 'a.', 'Pertaining to, or causing, gravitation; as, gravic forces;\n   gravic attraction.'),
(33460, 'Gravid', 'a.', 'Being with child; heavy with young; pregnant; fruitful; as,\n   a gravid uterus; gravid piety.'),
(33461, 'Graving', 'n.', 'The act of cleaning a ship\'s bottom.'),
(33462, 'Graving', 'n.', 'The act or art of carving figures in hard substances, esp.\n   by incision or in intaglio.'),
(33463, 'Graving', 'n.', 'That which is graved or carved.'),
(33464, 'Graving', 'n.', 'Impression, as upon the mind or heart.'),
(33465, 'Gravity', 'a.', 'The state of having weight; beaviness; as, the gravity of\n   lead.'),
(33466, 'Gravity', 'a.', 'Sobriety of character or demeanor.'),
(33467, 'Gravity', 'a.', 'Importance, significance, dignity, etc; hence,\n   seriousness; enormity; as, the gravity of an offense.'),
(33468, 'Gravity', 'a.', 'The tendency of a mass of matter toward a center of\n   attraction; esp., the tendency of a body toward the center of the\n   earth; terrestrial gravitation.'),
(33469, 'Gravity', 'a.', 'Lowness of tone; -- opposed to acuteness.'),
(33470, 'Gravies', 'pl. ', 'of Gravy'),
(33471, 'Gravy', 'n.', 'The juice or other liquid matter that drips from flesh in\n   cooking, made into a dressing for the food when served up.'),
(33472, 'Gravy', 'n.', 'Liquid dressing for meat, fish, vegetables, etc.'),
(33473, 'Grayback', 'n.', 'The California gray whale.'),
(33474, 'Grayback', 'n.', 'The redbreasted sandpiper or knot.'),
(33475, 'Grayback', 'n.', 'The dowitcher.'),
(33476, 'Grayback', 'n.', 'The body louse.'),
(33477, 'Grayfly', 'n.', 'The trumpet fly.'),
(33478, 'Grayish', 'a.', 'Somewhat gray.'),
(33479, 'Graylag', 'n.', 'The common wild gray goose (Anser anser) of Europe,\n   believed to be the wild form of the domestic goose. See Illust. of\n   Goose.'),
(33480, 'Grayling', 'a.', 'A European fish (Thymallus vulgaris), allied to the\n   trout, but having a very broad dorsal fin; -- called also umber. It\n   inhabits cold mountain streams, and is valued as a game fish.'),
(33481, 'Grayling', 'a.', 'An American fish of the genus Thymallus, having similar\n   habits to the above; one species (T. Ontariensis), inhabits several\n   streams in Michigan; another (T. montanus), is found in the Yellowstone\n   region.'),
(33482, 'Grayness', 'n.', 'The quality of being gray.'),
(33483, 'Grazed', 'imp. & p. p.', 'of Graze'),
(33484, 'Grazing', 'p. pr. & vb. n.', 'of Graze'),
(33485, 'Graze', 'v. t.', 'To feed or supply (cattle, sheep, etc.) with grass; to\n   furnish pasture for.'),
(33486, 'Graze', 'v. t.', 'To feed on; to eat (growing herbage); to eat grass from\n   (a pasture); to browse.'),
(33487, 'Graze', 'v. t.', 'To tend (cattle, etc.) while grazing.'),
(33488, 'Graze', 'v. t.', 'To rub or touch lightly the surface of (a thing) in\n   passing; as, the bullet grazed the wall.'),
(33489, 'Graze', 'v. i.', 'To eat grass; to feed on growing herbage; as, cattle\n   graze on the meadows.'),
(33490, 'Graze', 'v. i.', 'To yield grass for grazing.'),
(33491, 'Graze', 'v. i.', 'To touch something lightly in passing.'),
(33492, 'Graze', 'n.', 'The act of grazing; the cropping of grass.'),
