(33495, 'Grazier', 'n.', 'One who pastures cattle, and rears them for market.'),
(33496, 'Grazing', 'n.', 'The act of one who, or that which, grazes.'),
(33497, 'Grazing', 'n.', 'A pasture; growing grass.'),
(33498, 'Grazioso', 'adv.', 'Gracefully; smoothly; elegantly.'),
(33499, 'Grease', 'n.', 'Animal fat, as tallow or lard, especially when in a soft\n   state; oily or unctuous matter of any kind.'),
(33500, 'Grease', 'n.', 'An inflammation of a horse\'s heels, suspending the ordinary\n   greasy secretion of the part, and producing dryness and scurfiness,\n   followed by cracks, ulceration, and fungous excrescences.'),
(33501, 'Greased', 'imp. & p. p.', 'of Grease'),
(33502, 'Greasing', 'p. pr. & vb. n.', 'of Grease'),
(33503, 'Grease', 'v. t.', 'To smear, anoint, or daub, with grease or fat; to\n   lubricate; as, to grease the wheels of a wagon.'),
(33504, 'Grease', 'v. t.', 'To bribe; to corrupt with presents.'),
(33505, 'Grease', 'v. t.', 'To cheat or cozen; to overreach.'),
(33506, 'Grease', 'v. t.', 'To affect (a horse) with grease, the disease.'),
(33507, 'Greaser', 'n.', 'One who, or that which, greases; specifically, a person\n   employed to lubricate the working parts of machinery, engines,\n   carriages, etc.'),
(33508, 'Greaser', 'n.', 'A nickname sometimes applied in contempt to a Mexican of\n   the lowest type.'),
(33509, 'Greasily', 'adv.', 'In a greasy manner.'),
(33510, 'Greasily', 'adv.', 'In a gross or indelicate manner.'),
(33511, 'Greasy', 'superl.', 'Composed of, or characterized by, grease; oily;\n   unctuous; as, a greasy dish.'),
(33512, 'Greasy', 'superl.', 'Smeared or defiled with grease.'),
(33513, 'Greasy', 'superl.', 'Like grease or oil; smooth; seemingly unctuous to the\n   touch, as is mineral soapstone.'),
(33514, 'Greasy', 'superl.', 'Fat of body; bulky.'),
(33515, 'Greasy', 'superl.', 'Gross; indelicate; indecent.'),
(33516, 'Greasy', 'superl.', 'Affected with the disease called grease; as, the heels\n   of a horse. See Grease, n., 2.'),
(33517, 'Great', 'superl.', 'Large in space; of much size; big; immense; enormous;\n   expanded; -- opposed to small and little; as, a great house, ship,\n   farm, plain, distance, length.'),
(33518, 'Great', 'superl.', 'Large in number; numerous; as, a great company,\n   multitude, series, etc.'),
(33519, 'Great', 'superl.', 'Long continued; lengthened in duration; prolonged in\n   time; as, a great while; a great interval.'),
(33520, 'Great', 'superl.', 'Superior; admirable; commanding; -- applied to\n   thoughts, actions, and feelings.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(33521, 'Great', 'superl.', 'Endowed with extraordinary powers; uncommonly gifted;\n   able to accomplish vast results; strong; powerful; mighty; noble; as, a\n   great hero, scholar, genius, philosopher, etc.'),
(33522, 'Great', 'superl.', 'Holding a chief position; elevated: lofty: eminent;\n   distingushed; foremost; principal; as, great men; the great seal; the\n   great marshal, etc.'),
(33523, 'Great', 'superl.', 'Entitled to earnest consideration; weighty; important;\n   as, a great argument, truth, or principle.'),
(33524, 'Great', 'superl.', 'Pregnant; big (with young).'),
(33525, 'Great', 'superl.', 'More than ordinary in degree; very considerable in\n   degree; as, to use great caution; to be in great pain.'),
(33526, 'Great', 'superl.', 'Older, younger, or more remote, by single generation;\n   -- often used before grand to indicate one degree more remote in the\n   direct line of descent; as, great-grandfather (a grandfather\'s or a\n   grandmother\'s father), great-grandson, etc.'),
(33527, 'Great', 'n.', 'The whole; the gross; as, a contract to build a ship by the\n   great.'),
(33528, 'Greaten', 'v. t.', 'To make great; to aggrandize; to cause to increase in\n   size; to expand.'),
(33529, 'Greaten', 'v. i.', 'To become large; to dilate.'),
(33530, 'Greatly', 'adv.', 'In a great degree; much.'),
(33531, 'Greatly', 'adv.', 'Nobly; illustriously; magnanimously.'),
(33532, 'Greave', 'n.', 'A grove.'),
(33533, 'Greave', 'n.', 'Armor for the leg below the knee; -- usually in the plural.'),
(33534, 'Greaved', 'imp. & p. p.', 'of Greave'),
(33535, 'Greaving', 'p. pr. & vb. n.', 'of Greave'),
(33536, 'Greave', 'v. t.', 'To clean (a ship\'s bottom); to grave.'),
(33537, 'Greaves', 'n. pl.', 'The sediment of melted tallow. It is made into cakes\n   for dogs\' food. In Scotland it is called cracklings.'),
(33538, 'Grebe', 'n.', 'One of several swimming birds or divers, of the genus\n   Colymbus (formerly Podiceps), and allied genera, found in the northern\n   parts of America, Europe, and Asia. They have strong, sharp bills, and\n   lobate toes.'),
(33539, 'Grecian', 'a.', 'Of or pertaining to Greece; Greek.'),
(33540, 'Grecian', 'n.', 'A native or naturalized inhabitant of Greece; a Greek.'),
(33541, 'Grecian', 'n.', 'A jew who spoke Greek; a Hellenist.'),
(33542, 'Grecian', 'n.', 'One well versed in the Greek language, literature, or\n   history.'),
(33543, 'Grecism', 'n.', 'An idiom of the Greek language; a Hellenism.'),
(33544, 'Grecized', 'imp. & p. p.', 'of Grecize'),
