(33568, 'Green', 'superl.', 'Full of life aud vigor; fresh and vigorous; new;\n   recent; as, a green manhood; a green wound.'),
(33569, 'Green', 'superl.', 'Not ripe; immature; not fully grown or ripened; as,\n   green fruit, corn, vegetables, etc.'),
(33570, 'Green', 'superl.', 'Not roasted; half raw.'),
