(33575, 'Green', 'n.', 'Fresh leaves or branches of trees or other plants; wreaths;\n   -- usually in the plural.'),
(33576, 'Green', 'n.', 'pl. Leaves and stems of young plants, as spinach, beets,\n   etc., which in their green state are boiled for food.'),
