(33584, 'Greenish', 'a.', 'Somewhat green; having a tinge of green; as, a greenish\n   yellow.'),
(33585, 'Greenlet', 'n.', 'l. (Zool.) One of numerous species of small American\n   singing birds, of the genus Vireo, as the solitary, or blue-headed\n   (Vireo solitarius); the brotherly-love (V. Philadelphicus); the\n   warbling greenlet (V. gilvus); the yellow-throated greenlet (V.\n   flavifrons) and others. See Vireo.'),
(33586, 'Greenlet', 'n.', 'Any species of Cyclorhis, a genus of tropical American\n   birds allied to the tits.'),
(33587, 'Greenly', 'adv.', 'With a green color; newly; freshly, immaturely.'),
(33588, 'Greenly', 'a.', 'Of a green color.'),
(33589, 'Greenth', 'n.', 'The state or quality of being green; verdure.'),
