(33596, 'Greet', 'v. t.', 'To come upon, or meet, as with something that makes the\n   heart glad.'),
(33597, 'Greet', 'v. t.', 'To accost; to address.'),
(33598, 'Greet', 'v. i.', 'To meet and give salutations.'),
(33599, 'Greet', 'n.', 'Greeting.'),
(33600, 'Greeter', 'n.', 'One who greets or salutes another.'),
(33601, 'Greeter', 'n.', 'One who weeps or mourns.'),
(33602, 'Greeting', 'n.', 'Expression of kindness or joy; salutation at meeting; a\n   compliment from one absent.'),
(33603, 'Greeve', 'n.', 'See Grieve, an overseer.'),
(33604, 'Greeze', 'n.', 'A step. See Gree, a step.'),
