(33606, 'Gregal', 'a.', 'Pertaining to, or like, a flock.'),
(33607, '\\d8Gregarin\\91', 'n. pl.', 'An order of Protozoa, allied to the Rhizopoda,\n   and parasitic in other animals, as in the earthworm, lobster, etc. When\n   adult, they have a small, wormlike body inclosing a nucleus, but\n   without external organs; in one of the young stages, they are\n   amoebiform; -- called also Gregarinida, and Gregarinaria.'),
(33608, '\\d8Gregarinida', '', 'Gregarinae.'),
(33609, 'Grege', 'v. t.', 'Alt. of Gregge'),
(33610, 'Gregge', 'v. t.', 'To make heavy; to increase.'),
(33611, 'Greggoe', 'n.', 'Alt. of Grego'),
(33612, 'Grego', 'n.', 'A short jacket or cloak, made of very thick, coarse cloth,\n   with a hood attached, worn by the Greeks and others in the Levant.'),
