(33663, 'Griffin', 'n.', 'An Anglo-Indian name for a person just arrived from\n   Europe.'),
(33664, 'Griffin', 'n.', 'Alt. of Griffon'),
(33665, 'Griffon', 'n.', 'A fabulous monster, half lion and half eagle. It is often\n   represented in Grecian and Roman works of art.'),
(33666, 'Griffon', 'n.', 'A representation of this creature as an heraldic charge.'),
(33667, 'Griffon', 'n.', 'A species of large vulture (Gyps fulvus) found in the\n   mountainous parts of Southern Europe, North Africa, and Asia Minor; --\n   called also gripe, and grype. It is supposed to be the \"eagle\" of the\n   Bible. The bearded griffin is the lammergeir.'),
(33668, 'Griffon', 'n.', 'An English early apple.'),
(33669, 'Grill', 'v. t.', 'A gridiron.'),
(33670, 'Grill', 'v. t.', 'That which is broiled on a gridiron, as meat, fish, etc.'),
