(33672, 'Grilling', 'p. pr. & vb. n.', 'of Grill'),
(33673, 'Grill', 'n.', 'To broil on a grill or gridiron.'),
(33674, 'Grill', 'n.', 'To torment, as if by broiling.'),
(33675, 'Grillade', 'v. t.', 'The act of grilling; also, that which is grilled.'),
(33676, 'Grillage', 'n.', 'A framework of sleepers and crossbeams forming a\n   foundation in marshy or treacherous soil.'),
(33677, 'Grille', 'v. t.', 'A lattice or grating.'),
(33678, 'Grilly', 'v. t.', 'To broil; to grill; hence, To harass.'),
(33679, 'Grilse', 'n.', 'A young salmon after its first return from the sea.'),
(33680, 'Grimace', 'n.', 'A distortion of the countenance, whether habitual, from\n   affectation, or momentary aad occasional, to express some feeling, as\n   contempt, disapprobation, complacency, etc.; a smirk; a made-up face.'),
(33681, 'Grimace', 'v. i.', 'To make grimaces; to distort one\'s face; to make faces.'),
(33682, 'Grimaced', 'a.', 'Distorted; crabbed.'),
(33683, 'Grime', 'n.', 'Foul matter; dirt, rubbed in; sullying blackness, deeply\n   ingrained.'),
(33684, 'Grime', 'v. t.', 'To sully or soil deeply; to dirt.'),
(33685, 'Grimily', 'adv.', 'In a grimy manner.'),
(33686, 'Grimly', 'a.', 'Grim; hideous; stern.'),
(33687, 'Grimly', 'adv.', 'In a grim manner; fiercely.'),
(33688, 'Grimme', 'n.', 'A West African antelope (Cephalophus rufilotus) of a deep\n   bay color, with a broad dorsal stripe of black; -- called also\n   conquetoon.'),
(33689, 'Grimness', 'n.', 'Fierceness of look; sternness; crabbedness;\n   forbiddingness.'),
(33690, 'Grimsir', 'n.', 'A stern man.'),
(33691, 'Grimy', 'superl.', 'Full of grime; begrimed; dirty; foul.'),
