(33695, 'Grinding', 'p. pr. & vb. n.', 'of Grind'),
(33696, 'Grind', 'v. t.', 'To reduce to powder by friction, as in a mill, or with\n   the teeth; to crush into small fragments; to produce as by the action\n   of millstones.'),
(33697, 'Grind', 'v. t.', 'To wear down, polish, or sharpen, by friction; to make\n   smooth, sharp, or pointed; to whet, as a knife or drill; to rub against\n   one another, as teeth, etc.'),
(33698, 'Grind', 'v. t.', 'To oppress by severe exactions; to harass.'),
(33699, 'Grind', 'v. t.', 'To study hard for examination.'),
(33700, 'Grind', 'v. i.', 'To perform the operation of grinding something; to turn\n   the millstones.'),
(33701, 'Grind', 'v. i.', 'To become ground or pulverized by friction; as, this corn\n   grinds well.'),
(33702, 'Grind', 'v. i.', 'To become polished or sharpened by friction; as, glass\n   grinds smooth; steel grinds to a sharp edge.'),
(33703, 'Grind', 'v. i.', 'To move with much difficulty or friction; to grate.'),
(33704, 'Grind', 'v. i.', 'To perform hard aud distasteful service; to drudge; to\n   study hard, as for an examination.'),
(33705, 'Grind', 'n.', 'The act of reducing to powder, or of sharpening, by\n   friction.'),
(33706, 'Grind', 'n.', 'Any severe continuous work or occupation; esp., hard and\n   uninteresting study.'),
(33707, 'Grind', 'n.', 'A hard student; a dig.'),
(33708, 'Grinded', 'p. p.', 'Ground.'),
(33709, 'Grinder', 'n.', 'One who, or that which, grinds.'),
(33710, 'Grinder', 'n.', 'One of the double teeth, used to grind or masticate the\n   food; a molar.'),
(33711, 'Grinder', 'n.', 'The restless flycatcher (Seisura inquieta) of Australia;\n   -- called also restless thrush and volatile thrush. It makes a noise\n   like a scissors grinder, to which the name alludes.'),
(33712, 'Grindery', 'n.', 'Leather workers\' materials.'),
(33713, 'Grinding', 'a. & n.', 'from Grind.'),
(33714, 'Grindle', 'n.', 'The bowfin; -- called also Johnny Grindle.'),
(33715, 'Grindlet', 'n.', 'A small drain.'),
(33716, 'Grinner', 'n.', 'One who grins.'),
(33717, 'Grint', '', '3d pers. sing. pres. of Grind, contr. from grindeth.'),
(33718, 'Grinte', '', 'imp. of Grin, v. i., 1.'),
(33719, 'Grinting', 'n.', 'Grinding.'),
(33720, 'Gripe', 'n.', 'A vulture; the griffin.'),
(33721, 'Griped', 'imp. & p. p.', 'of Gripe'),
(33722, 'Griping', 'p. pr. & vb. n.', 'of Gripe'),
(33723, 'Gripe', 'v. t.', 'To catch with the hand; to clasp closely with the\n   fingers; to clutch.'),
(33724, 'Gripe', 'v. t.', 'To seize and hold fast; to embrace closely.'),
(33725, 'Gripe', 'v. t.', 'To pinch; to distress. Specifically, to cause pinching\n   and spasmodic pain to the bowels of, as by the effects of certain\n   purgative or indigestible substances.'),
(33726, 'Gripe', 'v. i.', 'To clutch, hold, or pinch a thing, esp. money, with a\n   gripe or as with a gripe.'),
(33727, 'Gripe', 'v. i.', 'To suffer griping pains.'),
(33728, 'Gripe', 'v. i.', 'To tend to come up into the wind, as a ship which, when\n   sailing closehauled, requires constant labor at the helm.'),
(33729, 'Gripe', 'n.', 'Grasp; seizure; fast hold; clutch.'),
(33730, 'Gripe', 'n.', 'That on which the grasp is put; a handle; a grip; as, the\n   gripe of a sword.'),
(33731, 'Gripe', 'n.', 'A device for grasping or holding anything; a brake to stop a\n   wheel.'),
(33732, 'Gripe', 'n.', 'Oppression; cruel exaction; affiction; pinching distress;\n   as, the gripe of poverty.'),
(33733, 'Gripe', 'n.', 'Pinching and spasmodic pain in the intestines; -- chiefly\n   used in the plural.'),
(33734, 'Gripe', 'n.', 'The piece of timber which terminates the keel at the fore\n   end; the forefoot.'),
(33735, 'Gripe', 'n.', 'The compass or sharpness of a ship\'s stern under the water,\n   having a tendency to make her keep a good wind.'),
(33736, 'Gripe', 'n.', 'An assemblage of ropes, dead-eyes, and hocks, fastened to\n   ringbolts in the deck, to secure the boats when hoisted; also, broad\n   bands passed around a boat to secure it at the davits and prevent\n   swinging.'),
(33737, 'Gripeful', 'a.', 'Disposed to gripe; extortionate.'),
(33738, 'Griper', 'a.', 'One who gripes; an oppressor; an extortioner.'),
(33739, 'Griman', 'n.', 'The man who manipulates a grip.'),
(33740, 'Grippe', 'n.', 'The influenza or epidemic catarrh.'),
(33741, 'Gripper', 'n.', 'One who, or that which, grips or seizes.'),
(33742, 'Gripper', 'n.', 'In printing presses, the fingers or nippers.'),
(33743, 'Gripple', 'n.', 'A grasp; a gripe.'),
(33744, 'Gripple', 'a.', 'Griping; greedy; covetous; tenacious.'),
(33745, 'Gripsack', 'n.', 'A traveler\'s handbag.'),
(33746, 'Grise', 'n.', 'See Grice, a pig.'),
(33747, 'Grise', 'n.', 'A step (in a flight of stairs); a degree.'),
(33748, 'Griseous', 'a.', 'Of a light color, or white, mottled with black or brown;\n   grizzled or grizzly.'),
(33749, 'Grisette', 'n.', 'A French girl or young married woman of the lower class;\n   more frequently, a young working woman who is fond of gallantry.'),
(33750, 'Griskin', 'n.', 'The spine of a hog.'),
(33751, 'Grisled', 'a.', 'See Grizzled.'),
(33752, 'Grisly', 'a.', 'Frightful; horrible; dreadful; harsh; as, grisly locks; a\n   grisly specter.'),
(33753, 'Grison', 'n.', 'A South American animal of the family Mustelidae (Galictis\n   vittata). It is about two feet long, exclusive of the tail. Its under\n   parts are black. Also called South American glutton.'),
(33754, 'Grison', 'n.', 'A South American monkey (Lagothrix infumatus), said to be\n   gluttonous.'),
(33755, 'Grisons', 'n. pl.', 'Inhabitants of the eastern Swiss Alps.'),
(33756, 'Grisons', 'n. pl.', 'The largest and most eastern of the Swiss cantons.'),
(33757, 'Grist', 'n.', 'Ground corn; that which is ground at one time; as much grain\n   as is carried to the mill at one time, or the meal it produces.'),
(33758, 'Grist', 'n.', 'Supply; provision.'),
(33759, 'Grist', 'n.', 'In rope making, a given size of rope, common grist being a\n   rope three inches in circumference, with twenty yarns in each of the\n   three strands.'),
(33760, 'Gristle', 'n.', 'Cartilage. See Cartilage.'),
(33761, 'Gristly', 'a.', 'Consisting of, or containing, gristle; like gristle;\n   cartilaginous.'),
(33762, 'Gritted', 'imp. & p. p.', 'of Grit'),
(33763, 'Gritting', 'p. pr. &, vb. n.', 'of Grit'),
(33764, 'Grith', 'n.', 'Peace; security; agreement.'),
(33765, 'Gritrock', 'n.', 'Alt. of Gritstone'),
(33766, 'Gritty', 'a.', 'Containing sand or grit; consisting of grit; caused by\n   grit; full of hard particles.'),
(33767, 'Gritty', 'a.', 'Spirited; resolute; unyielding.'),
(33768, 'Grivet', 'n.', 'A monkey of the upper Nile and Abyssinia (Cercopithecus\n   griseo-viridis), having the upper parts dull green, the lower parts\n   white, the hands, ears, and face black. It was known to the ancient\n   Egyptians. Called also tota.'),
(33769, 'Grize', 'n.', 'Same as 2d Grise.'),
(33770, 'Grizelin', 'a.', 'See Gridelin.'),
(33771, 'Grizzle', 'n.', 'Gray; a gray color; a mixture of white and black.'),
(33772, 'Grizzled', 'a.', 'Gray; grayish; sprinkled or mixed with gray; of a mixed\n   white and black.'),
(33773, 'Grizzly', 'a.', 'Somewhat gray; grizzled.'),
(33774, 'Grizzly', 'n.', 'A grizzly bear. See under Grizzly, a.'),
(33775, 'Grizzly', 'a.', 'In hydraulic mining, gratings used to catch and throw out\n   large stones from the sluices.'),
(33776, 'Groaned', 'imp. & p. p.', 'of Groan'),
(33777, 'Groaning', 'p. pr. & vb. n.', 'of Groan'),
(33778, 'Groan', 'v. i.', 'To give forth a low, moaning sound in breathing; to utter\n   a groan, as in pain, in sorrow, or in derision; to moan.'),
(33779, 'Groan', 'v. i.', 'To strive after earnestly, as with groans.'),
(33780, 'Groan', 'v. t.', 'To affect by groans.'),
(33781, 'Groan', 'n.', 'A low, moaning sound; usually, a deep, mournful sound\n   uttered in pain or great distress; sometimes, an expression of strong\n   disapprobation; as, the remark was received with groans.'),
(33782, 'Groanful', 'a.', 'Agonizing; sad.'),
(33783, 'Groat', 'n.', 'An old English silver coin, equal to four pence.'),
(33784, 'Groat', 'n.', 'Any small sum of money.'),
(33785, 'Groats', 'n. pl.', 'Dried grain, as oats or wheat, hulled and broken or\n   crushed; in high milling, cracked fragments of wheat larger than grits.'),
(33786, 'Grocer', 'n.', 'A trader who deals in tea, sugar, spices, coffee, fruits,\n   and various other commodities.'),
(33787, 'Grocery', 'n.', 'The commodities sold by grocers, as tea, coffee, spices,\n   etc.; -- in the United States almost always in the plural form, in this\n   sense.'),
(33788, 'Grocery', 'n.', 'A retail grocer\'s shop or store.'),
(33789, 'Groggery', 'n.', 'A grogshop.'),
(33790, 'Groggy', 'a.', 'Overcome with grog; tipsy; unsteady on the legs.'),
(33791, 'Groggy', 'a.', 'Weakened in a fight so as to stagger; -- said of pugilists.'),
(33792, 'Groggy', 'a.', 'Moving in a hobbling manner, owing to ten der feet; -- said\n   of a horse.'),
(33793, 'Grogram', 'n.', 'Alt. of Grogran'),
(33794, 'Grogran', 'n.', 'A coarse stuff made of silk and mohair, or of coarse silk.'),
(33795, 'Grogshop', 'n.', 'A shop or room where strong liquors are sold and drunk; a\n   dramshop.'),
(33796, 'Groin', 'n.', 'The snout of a swine.'),
(33797, 'Groin', 'v. i.', 'To grunt to growl; to snarl; to murmur.'),
(33798, 'Groin', 'n.', 'The line between the lower part of the abdomen and the\n   thigh, or the region of this line; the inguen.'),
(33799, 'Groin', 'n.', 'The projecting solid angle formed by the meeting of two\n   vaults, growing more obtuse as it approaches the summit.'),
(33800, 'Groin', 'n.', 'The surface formed by two such vaults.'),
(33801, 'Groin', 'n.', 'A frame of woodwork across a beach to accumulate and retain\n   shingle.'),
(33802, 'Groined', 'imp. & p. p.', 'of Groin'),
(33803, 'Groining', 'p. pr. & vb. n.', 'of Groin'),
(33804, 'Groin', 'v. t.', 'To fashion into groins; to build with groins.'),
(33805, 'Groined', 'a.', 'Built with groins; as, a groined ceiling; a groined vault.'),
(33806, 'Gromet', 'n.', 'Same as Grommet.'),
(33807, 'Gromill', 'n.', 'See Gromwell.'),
(33808, 'Grommet', 'n.', 'A ring formed by twisting on itself a single strand of an\n   unlaid rope; also, a metallic eyelet in or for a sail or a mailbag.\n   Sometimes written grummet.'),
(33809, 'Grommet', 'n.', 'A ring of rope used as a wad to hold a cannon ball in\n   place.'),
(33810, 'Gromwell', 'n.', 'A plant of the genus Lithospermum (L. arvense), anciently\n   used, because of its stony pericarp, in the cure of gravel. The German\n   gromwell is the Stellera.'),
(33811, 'Grond', '', 'obs. imp. of Grind.'),
(33812, 'Gronte', '', 'obs. imp. of Groan.'),
(33813, 'Groom', 'n.', 'A boy or young man; a waiter; a servant; especially, a man\n   or boy who has charge of horses, or the stable.'),
(33814, 'Groom', 'n.', 'One of several officers of the English royal household,\n   chiefly in the lord chamberlain\'s department; as, the groom of the\n   chamber; the groom of the stole.'),
(33815, 'Groom', 'n.', 'A man recently married, or about to be married; a\n   bridegroom.'),
(33816, 'Groomed', 'imp. & p. p.', 'of Groom'),
(33817, 'Grooming', 'p. pr. & vb. n.', 'of Groom'),
(33818, 'Groom', 'v. i.', 'To tend or care for, or to curry or clean, as a, horse.'),
(33819, 'Groomer', 'n.', 'One who, or that which, grooms horses; especially, a brush\n   rotated by a flexible or jointed revolving shaft, for cleaning horses.'),
(33820, 'Grooper', 'n.', 'See Grouper.'),
(33821, 'Groove', 'n.', 'A furrow, channel, or long hollow, such as may be formed by\n   cutting, molding, grinding, the wearing force of flowing water, or\n   constant travel; a depressed way; a worn path; a rut.'),
(33822, 'Groove', 'n.', 'Hence: The habitual course of life, work, or affairs; fixed\n   routine.'),
(33823, 'Groove', 'n.', 'A shaft or excavation.'),
(33824, 'Grooved', 'imp. & p. p.', 'of Groove'),
(33825, 'Groving', 'p. pr. & vb. n.', 'of Groove'),
(33826, 'Groove', 'v. t.', 'To cut a groove or channel in; to form into channels or\n   grooves; to furrow.'),
(33827, 'Groover', 'n.', 'One who or that which grooves.'),
(33828, 'Groover', 'n.', 'A miner.'),
(33829, 'Grooving', 'n.', 'The act of forming a groove or grooves; a groove, or\n   collection of grooves.'),
(33830, 'Groped', 'imp. & p. p.', 'of Grope'),
(33831, 'Groping', 'p. pr. & vb. n.', 'of Grope'),
(33832, 'Grope', 'v. i.', 'To feel with or use the hands; to handle.'),
(33833, 'Grope', 'v. i.', 'To search or attempt to find something in the dark, or,\n   as a blind person, by feeling; to move about hesitatingly, as in\n   darkness or obscurity; to feel one\'s way, as with the hands, when one\n   can not see.'),
(33834, 'Grope', 'v. t.', 'To search out by feeling in the dark; as, we groped our\n   way at midnight.'),
(33835, 'Grope', 'v. t.', 'To examine; to test; to sound.'),
(33836, 'Groper', 'n.', 'One who gropes; one who feels his way in the dark, or\n   searches by feeling.'),
(33837, 'Grosbeak', 'n.', 'One of various species of finches having a large, stout\n   beak. The common European grosbeak or hawfinch is Coccothraustes\n   vulgaris.'),
(33838, 'Groschen', 'n.', 'A small silver coin and money of account of Germany,\n   worth about two cents. It is not included in the new monetary system of\n   the empire.'),
(33839, 'Gross', 'superl.', 'Great; large; bulky; fat; of huge size; excessively\n   large.'),
(33840, 'Gross', 'superl.', 'Coarse; rough; not fine or delicate.'),
(33841, 'Gross', 'superl.', 'Not easily aroused or excited; not sensitive in\n   perception or feeling; dull; witless.'),
(33842, 'Gross', 'superl.', 'Expressing, Or originating in, animal or sensual\n   appetites; hence, coarse, vulgar, low, obscene, or impure.'),
(33843, 'Gross', 'superl.', 'Thick; dense; not attenuated; as, a gross medium.'),
(33844, 'Gross', 'superl.', 'Great; palpable; serious; vagrant; shameful; as, a\n   gross mistake; gross injustice; gross negligence.'),
(33845, 'Gross', 'superl.', 'Whole; entire; total; without deduction; as, the gross\n   sum, or gross amount, the gross weight; -- opposed to net.'),
(33846, 'Gross', 'a.', 'The main body; the chief part, bulk, or mass.'),
(33847, 'Gross', 'sing. & pl.', 'The number of twelve dozen; twelve times twelve;\n   as, a gross of bottles; ten gross of pens.'),
(33848, 'Grossly', 'adv.', 'In a gross manner; greatly; coarsely; without delicacy;\n   shamefully; disgracefully.'),
(33849, 'Grote', 'n.', 'A groat.'),
(33850, 'Grottoes', 'pl. ', 'of Grotto'),
(33851, 'Grotto', 'n.', 'A natural covered opening in the earth; a cave; also, an\n   artificial recess, cave, or cavernlike apartment.'),
(33852, 'Ground', 'n.', 'The surface of the earth; the outer crust of the globe, or\n   some indefinite portion of it.'),
(33853, 'Ground', 'n.', 'A floor or pavement supposed to rest upon the earth.'),
(33854, 'Ground', 'n.', 'Any definite portion of the earth\'s surface; region;\n   territory; country. Hence: A territory appropriated to, or resorted to,\n   for a particular purpose; the field or place of action; as, a hunting\n   or fishing ground; a play ground.'),
(33855, 'Ground', 'n.', 'Land; estate; possession; field; esp. (pl.), the gardens,\n   lawns, fields, etc., belonging to a homestead; as, the grounds of the\n   estate are well kept.'),
(33856, 'Ground', 'n.', 'The basis on which anything rests; foundation. Hence: The\n   foundation of knowledge, belief, or conviction; a premise, reason, or\n   datum; ultimate or first principle; cause of existence or occurrence;\n   originating force or agency; as, the ground of my hope.'),
(33857, 'Ground', 'n.', 'That surface upon which the figures of a composition are\n   set, and which relieves them by its plainness, being either of one tint\n   or of tints but slightly contrasted with one another; as, crimson\n   Bowers on a white ground.'),
(33858, 'Ground', 'n.', 'In sculpture, a flat surface upon which figures are raised\n   in relief.'),
(33859, 'Ground', 'n.', 'In point lace, the net of small meshes upon which the\n   embroidered pattern is applied; as, Brussels ground. See Brussels lace,\n   under Brussels.'),
(33860, 'Ground', 'n.', 'A gummy composition spread over the surface of a metal to\n   be etched, to prevent the acid from eating except where an opening is\n   made by the needle.'),
(33861, 'Ground', 'n.', 'One of the pieces of wood, flush with the plastering, to\n   which moldings, etc., are attached; -- usually in the plural.'),
(33862, 'Ground', 'n.', 'A composition in which the bass, consisting of a few bars\n   of independent notes, is continually repeated to a varying melody.'),
(33863, 'Ground', 'n.', 'The tune on which descants are raised; the plain song.'),
(33864, 'Ground', 'n.', 'A conducting connection with the earth, whereby the earth\n   is made part of an electrical circuit.'),
(33865, 'Ground', 'n.', 'Sediment at the bottom of liquors or liquids; dregs; lees;\n   feces; as, coffee grounds.'),
(33866, 'Ground', 'n.', 'The pit of a theater.'),
(33867, 'Grounded', 'imp. & p. p.', 'of Ground'),
(33868, 'Ground', 'v. t.', 'To lay, set, or run, on the ground.'),
(33869, 'Ground', 'v. t.', 'To found; to fix or set, as on a foundation, reason, or\n   principle; to furnish a ground for; to fix firmly.'),
(33870, 'Ground', 'v. t.', 'To instruct in elements or first principles.'),
(33871, 'Ground', 'v. t.', 'To connect with the ground so as to make the earth a\n   part of an electrical circuit.'),
(33872, 'Ground', 'v. t.', 'To cover with a ground, as a copper plate for etching\n   (see Ground, n., 5); or as paper or other materials with a uniform tint\n   as a preparation for ornament.'),
(33873, 'Ground', 'v. i.', 'To run aground; to strike the bottom and remain fixed;\n   as, the ship grounded on the bar.'),
(33874, 'Ground', '', 'imp. & p. p. of Grind.'),
(33875, 'Grounden', '', 'p. p. of Grind.'),
(33876, 'Groundly', 'adv.', 'Solidly; deeply; thoroughly.'),
(33877, 'Group', 'n.', 'A cluster, crowd, or throng; an assemblage, either of\n   persons or things, collected without any regular form or arrangement;\n   as, a group of men or of trees; a group of isles.'),
(33878, 'Group', 'n.', 'An assemblage of objects in a certain order or relation, or\n   having some resemblance or common characteristic; as, groups of strata.'),
(33879, 'Group', 'n.', 'A variously limited assemblage of animals or plants, having\n   some resemblance, or common characteristics in form or structure. The\n   term has different uses, and may be made to include certain species of\n   a genus, or a whole genus, or certain genera, or even several orders.'),
(33880, 'Group', 'n.', 'A number of eighth, sixteenth, etc., notes joined at the\n   stems; -- sometimes rather indefinitely applied to any ornament made up\n   of a few short notes.'),
(33881, 'Grouped', 'imp. & p. p.', 'of Group'),
(33882, 'Grouping', 'p. pr. & vb. n.', 'of Group'),
(33883, 'Group', 'n.', 'To form a group of; to arrange or combine in a group or in\n   groups, often with reference to mutual relation and the best effect; to\n   form an assemblage of.'),
(33884, 'Grouper', 'n.', 'One of several species of valuable food fishes of the\n   genus Epinephelus, of the family Serranidae, as the red grouper, or\n   brown snapper (E. morio), and the black grouper, or warsaw (E.\n   nigritus), both from Florida and the Gulf of Mexico.'),
(33885, 'Grouper', 'n.', 'The tripletail (Lobotes).'),
(33886, 'Grouper', 'n.', 'In California, the name is often applied to the\n   rockfishes.'),
(33887, 'Grouping', 'n.', 'The disposal or relative arrangement of figures or\n   objects, as in, drawing, painting, and sculpture, or in ornamental\n   design.'),
(33888, 'Grouse', 'n. sing. & pl.', 'Any of the numerous species of gallinaceous\n   birds of the family Tetraonidae, and subfamily Tetraoninae, inhabiting\n   Europe, Asia, and North America. They have plump bodies, strong,\n   well-feathered legs, and usually mottled plumage. The group includes\n   the ptarmigans (Lagopus), having feathered feet.'),
(33889, 'Grouse', 'v. i.', 'To seek or shoot grouse.'),
(33890, 'Grouse', 'v. i.', 'To complain or grumble.'),
(33891, 'Grouser', 'n.', 'A pointed timber attached to a boat and sliding\n   vertically, to thrust into the ground as a means of anchorage.'),
(33892, 'Grout', 'n.', 'Coarse meal; ground malt; pl. groats.'),
(33893, 'Grout', 'n.', 'Formerly, a kind of beer or ale.'),
(33894, 'Grout', 'n.', 'Lees; dregs; grounds.'),
(33895, 'Grout', 'n.', 'A thin, coarse mortar, used for pouring into the joints of\n   masonry and brickwork; also, a finer material, used in finishing the\n   best ceilings. Gwilt.'),
(33896, 'Grouted', 'imp. & p. p.', 'of Grout'),
(33897, 'Grouting', 'p. pr. & vb. n.', 'of Grout'),
(33898, 'Grout', 'v. t.', 'To fill up or finish with grout, as the joints between\n   stones.'),
(33899, 'Grouting', 'n.', 'The process of filling in or finishing with grout; also,\n   the grout thus filled in.'),
(33900, 'Groutnol', 'n.', 'Same as Growthead.'),
(33901, 'Grouty', 'a.', 'Cross; sulky; sullen.'),
(33902, 'Grove', 'v.', 'A smaller group of trees than a forest, and without\n   underwood, planted, or growing naturally as if arranged by art; a wood\n   of small extent.'),
(33903, 'Groveled', 'imp. & p. p.', 'of Grovel'),
(33904, 'Grovel', 'adv.', 'To creep on the earth, or with the face to the ground; to\n   lie prone, or move uneasily with the body prostrate on the earth; to\n   lie fiat on one\'s belly, expressive of abjectness; to crawl.'),
(33905, 'Grovel', 'adv.', 'To tend toward, or delight in, what is sensual or base;\n   to be low, abject, or mean.'),
(33906, 'Groveler', 'n.', 'One who grovels; an abject wretch.'),
(33907, 'Grovy', 'a.', 'Pertaining to, or resembling, a grove; situated in, or\n   frequenting, groves.'),
(33908, 'Grown', 'p. p.', 'of Grow'),
(33909, 'Growing', 'p. pr. & vb. n.', 'of Grow'),
(33910, 'Growable', 'a.', 'Capable of growth.'),
(33911, 'Growan', 'n.', 'A decomposed granite, forming a mass of gravel, as in tin\n   lodes in Cornwall.'),
(33912, 'Grower', 'n.', 'One who grows or produces; as, a grower of corn; also, that\n   which grows or increases; as, a vine may be a rank or a slow grower.'),
(33913, 'Growled', 'imp. & p. p.', 'of Growl'),
(33914, 'Growling', 'p. pr. & vb. e.', 'of Growl'),
(33915, 'Growl', 'v. i.', 'To utter a deep guttural sound, sa an angry dog; to give\n   forth an angry, grumbling sound.'),
(33916, 'Growl', 'v. t.', 'To express by growling.'),
(33917, 'Growl', 'n.', 'The deep, threatening sound made by a surly dog; a grumbling\n   sound.'),
(33918, 'Growler', 'n.', 'One who growls.'),
(33919, 'Growler', 'n.', 'The large-mouthed black bass.'),
(33920, 'Growler', 'n.', 'A four-wheeled cab.'),
(33921, 'Grown', '', 'p. p. of Grow.'),
(33922, 'Growse', 'v. i.', 'To shiver; to have chills.'),
(33923, 'Growth', 'n.', 'The process of growing; the gradual increase of an animal\n   or a vegetable body; the development from a seed, germ, or root, to\n   full size or maturity; increase in size, number, frequency, strength,\n   etc.; augmentation; advancement; production; prevalence or influence;\n   as, the growth of trade; the growth of power; the growth of\n   intemperance. Idle weeds are fast in growth.'),
(33924, 'Growth', 'n.', 'That which has grown or is growing; anything produced;\n   product; consequence; effect; result.'),
(33925, 'Groyne', 'n.', 'See Groin.'),
(33926, 'Grubbed', 'imp. & p. p.', 'of Grub'),
(33927, 'Grubbing', 'p. pr. & vb. n.', 'of Grub'),
(33928, 'Grubber', 'n.', 'One who, or that which, grubs; especially, a machine or\n   tool of the nature of a grub ax, grub hook, etc.'),
(33929, 'Grubbla', 'v. t. & i.', 'To feel or grope in the dark.'),
(33930, 'Grubby', 'a.', 'Dirty; unclean.'),
(33931, 'Grubby', 'n.', 'Any species of Cottus; a sculpin.'),
(33932, 'Grubworm', 'n.', 'See Grub, n., 1.'),
(33933, 'Grucche', 'v. i.', 'To murmur; to grumble.'),
(33934, 'Grudger', 'imp. & p. p.', 'of Grudge'),
(33935, 'Grudging', 'p. pr. & vb. n.', 'of Grudge'),
(33936, 'Grudge', 'v. t.', 'To look upon with desire to possess or to appropriate;\n   to envy (one) the possession of; to begrudge; to covet; to give with\n   reluctance; to desire to get back again; -- followed by the direct\n   object only, or by both the direct and indirect objects.'),
(33937, 'Grudge', 'v. t.', 'To hold or harbor with malicioua disposition or purpose;\n   to cherish enviously.'),
(33938, 'Grudge', 'v. i.', 'To be covetous or envious; to show discontent; to\n   murmur; to complain; to repine; to be unwilling or reluctant.'),
(33939, 'Grudge', 'v. i.', 'To feel compunction or grief.'),
(33940, 'Grudge', 'n.', 'Sullen malice or malevolence; cherished malice, enmity, or\n   dislike; ill will; an old cause of hatred or quarrel.'),
(33941, 'Grudge', 'n.', 'Slight symptom of disease.'),
(33942, 'Gurgeons', 'n. pl.', 'Coarse meal.'),
(33943, 'Gruddger', 'n.', 'One who grudges.'),
(33944, 'Gruel', 'n.', 'A light, liquid food, made by boiling meal of maize,\n   oatmeal, or fiour in water or milk; thin porridge.'),
(33945, 'Gruelly', 'a.', 'Like gruel; of the consistence of gruel.'),
(33946, 'Gruesome', 'a.', 'Same as Grewsome.'),
(33947, 'Gruff', 'superl.', 'Of a rough or stern manner, voice, or countenance;\n   sour; surly; severe; harsh.'),
(33948, 'Grunbled', 'imp. & p. p.', 'of Grumble'),
(33949, 'Grumble', 'v. i.', 'To murmur or mutter with discontent; to make\n   ill-natured complaints in a low voice and a surly manner.'),
(33950, 'Grumble', 'v. i.', 'To growl; to snarl in deep tones; as, a lion grumbling\n   over his prey.'),
(33951, 'Grumble', 'v. i.', 'To rumble; to make a low, harsh, and heavy sound; to\n   mutter; as, the distant thunder grumbles.'),
(33952, 'Grumble', 'v. t.', 'To express or utter with grumbling.'),
(33953, 'Grumble', 'n.', 'The noise of one that grumbles.'),
(33954, 'Grumble', 'n.', 'A grumbling, discontented disposition.'),
(33955, 'Grumbler', 'n.', 'One who grumbles.'),
(33956, 'Grume', 'n.', 'A thick, viscid fluid; a clot, as of blood.'),
(33957, 'Grumbly', 'adv.', 'In a grum manner.'),
(33958, 'Grumose', 'a.', 'Clustered in grains at intervals; grumous.'),
(33959, 'Grumous', 'a.', 'Resembling or containing grume; thick; concreted; clotted;\n   as, grumous blood.'),
(33960, 'Grumous', 'a.', 'See Grumose.'),
(33961, 'Grumpily', 'adv.', 'In a surly manner; sullenly.'),
(33962, 'Grumpy', 'a.', 'Surly; dissatisfied; grouty.'),
(33963, 'Grundel', 'n.', 'A groundling (fish).'),
(33964, 'Grundsel', 'n.', 'Groundsel.'),
(33965, 'Grunted', 'imp. & p. p.', 'of Grunt'),
(33966, 'Grunting', 'p. pr. & vb. n.', 'of Grunt'),
(33967, 'Grunt', 'v. t.', 'To make a deep, short noise, as a hog; to utter a short\n   groan or a deep guttural sound.'),
(33968, 'Grunt', 'n.', 'A deep, guttural sound, as of a hog.'),
(33969, 'Grunt', 'n.', 'Any one of several species of American food fishes, of the\n   genus Haemulon, allied to the snappers, as, the black grunt (A.\n   Plumieri), and the redmouth grunt (H. aurolineatus), of the Southern\n   United States; -- also applied to allied species of the genera\n   Pomadasys, Orthopristis, and Pristopoma. Called also pigfish, squirrel\n   fish, and grunter; -- so called from the noise it makes when taken.'),
(33970, 'Grunter', 'n.', 'One who, or that which, grunts; specifically, a hog.'),
(33971, 'Grunter', 'n.', 'One of several American marine fishes. See Sea robin, and\n   Grunt, n., 2.'),
(33972, 'Grunter', 'n.', 'A hook used in lifting a crucible.'),
(33973, 'Gruntle', 'v. i.', 'To grunt; to grunt repeatedly.'),
(33974, 'Grutch', 'v.', 'See Grudge.'),
(33975, 'Gryde', 'v. i.', 'To gride. See Gride.'),
(33976, 'Gryfon', 'n.', 'See Griffin.'),
(33977, 'Gryllus', 'n.', 'A genus of insects including the common crickets.'),
(33978, 'Grype', 'v. t.', 'To gripe.'),
(33979, 'Grype', 'n.', 'A vulture; the griffin.'),
(33980, 'Gryphaea', 'n.', 'A genus of cretaceous fossil shells allied to the oyster.'),
(33981, 'Gryphite', 'n.', 'A shell of the genus Gryphea.'),
(33982, 'Gryphon', 'n.', 'The griffin vulture.'),
(33983, 'Grysbok', 'n.', 'A small South African antelope (Neotragus melanotis). It\n   is speckled with gray and chestnut, above; the under parts are reddish\n   fawn.'),
(33984, 'Guacharo', 'n.', 'A nocturnal bird of South America and Trinidad\n   (Steatornis Caripensis, or S. steatornis); -- called also oilbird.'),
(33985, 'Guachos', 'pl. ', 'of Guacho'),
(33986, 'Guacho', 'n.', 'One of the mixed-blood (Spanish-Indian) inhabitants of the\n   pampas of South America; a mestizo.'),
(33987, 'Guacho', 'n.', 'An Indian who serves as a messenger.'),
(33988, 'Guaco', 'n.', 'A plant (Aristolochia anguicida) of Carthagena, used as an\n   antidote to serpent bites.'),
(33989, 'Guaco', 'n.', 'The Mikania Guaco, of Brazil, used for the same purpose.'),
(33990, 'Guaiac', 'a.', 'Pertaining to, or resembling, guaiacum.'),
(33991, 'Guaiac', 'n.', 'Guaiacum.'),
(33992, 'Guaiacum', 'n.', 'A genus of small, crooked trees, growing in tropical\n   America.'),
(33993, 'Guaiacum', 'n.', 'The heart wood or the resin of the Guaiacum offinale or\n   lignum-vitae, a large tree of the West Indies and Central America. It\n   is much used in medicine.'),
(33994, 'Guana', 'n.', 'See Iguana.'),
(33995, 'Guanacos', 'pl. ', 'of Guanaco'),
(33996, 'Guanaco', 'n.', 'A South American mammal (Auchenia huanaco), allied to the\n   llama, but of larger size and more graceful form, inhabiting the\n   southern Andes and Patagonia. It is supposed by some to be the llama in\n   a wild state.'),
(33997, 'Guanin', 'n.', 'A crystalline substance (C5H5N5O) contained in guano. It is\n   also a constituent of the liver, pancreas, and other glands in mammals.'),
(33998, 'Guanos', 'pl. ', 'of Guano'),
(33999, 'Guano', 'n.', 'A substance found in great abundance on some coasts or\n   islands frequented by sea fowls, and composed chiefly of their\n   excrement. It is rich in phosphates and ammonia, and is used as a\n   powerful fertilizer.'),
(34000, 'Guara', 'n.', 'The scarlet ibis. See Ibis.'),
(34001, 'Guara', 'n.', 'A large-maned wild dog of South America (Canis jubatus) --\n   named from its cry.'),
(34002, 'Guarana', 'n.', 'A preparation from the seeds of Paullinia sorbilis, a\n   woody climber of Brazil, used in making an astringent drink, and also\n   in the cure of headache.'),
(34003, 'Guaranty', 'n.', 'In law and common usage: An undertaking to answer for the\n   payment of some debt, or the performance of some contract or duty, of\n   another, in case of the failure of such other to pay or perform; a\n   guarantee; a warranty; a security.'),
(34004, 'Guaranty', 'n.', 'In law and common usage: To undertake or engage that\n   another person shall perform (what he has stipulated); to undertake to\n   be answerable for (the debt or default of another); to engage to answer\n   for the performance of (some promise or duty by another) in case of a\n   failure by the latter to perform; to undertake to secure (something) to\n   another, as in the case of a contingency. See Guarantee, v. t.'),
(34005, 'Guarded', 'imp. & p. p.', 'of Guard'),
(34006, 'Gurding', 'p. pr. &, vb. n.', 'of Guard'),
(34007, 'Guard', 'n.', 'To protect from danger; to secure against surprise, attack,\n   or injury; to keep in safety; to defend; to shelter; to shield from\n   surprise or attack; to protect by attendance; to accompany for\n   protection; to care for.'),
(34008, 'Guard', 'n.', 'To keep watch over, in order to prevent escape or restrain\n   from acts of violence, or the like.'),
(34009, 'Guard', 'n.', 'To protect the edge of, esp. with an ornamental border;\n   hence, to face or ornament with lists, laces, etc.'),
(34010, 'Guard', 'n.', 'To fasten by binding; to gird.'),
(34011, 'Guard', 'v. i.', 'To watch by way of caution or defense; to be caution; to\n   be in a state or position of defense or safety; as, careful persons\n   guard against mistakes.'),
(34012, 'Guard', 'v. t.', 'One who, or that which, guards from injury, danger,\n   exposure, or attack; defense; protection.'),
(34013, 'Guard', 'v. t.', 'A man, or body of men, stationed to protect or control a\n   person or position; a watch; a sentinel.'),
(34014, 'Guard', 'v. t.', 'One who has charge of a mail coach or a railway train; a\n   conductor.'),
(34015, 'Guard', 'v. t.', 'Any fixture or attachment designed to protect or secure\n   against injury, soiling, or defacement, theft or loss'),
(34016, 'Guard', 'v. t.', 'That part of a sword hilt which protects the hand.'),
(34017, 'Guard', 'v. t.', 'Ornamental lace or hem protecting the edge of a garment.'),
(34018, 'Guard', 'v. t.', 'A chain or cord for fastening a watch to one\'s person or\n   dress.'),
(34019, 'Guard', 'v. t.', 'A fence or rail to prevent falling from the deck of a\n   vessel.'),
(34020, 'Guard', 'v. t.', 'An extension of the deck of a vessel beyond the hull;\n   esp., in side-wheel steam vessels, the framework of strong timbers,\n   which curves out on each side beyond the paddle wheel, and protects it\n   and the shaft against collision.'),
(34021, 'Guard', 'v. t.', 'A plate of metal, beneath the stock, or the lock frame,\n   of a gun or pistol, having a loop, called a bow, to protect the\n   trigger.'),
(34022, 'Guard', 'v. t.', 'An interleaved strip at the back, as in a scrap book, to\n   guard against its breaking when filled.'),
(34023, 'Guard', 'v. t.', 'A posture of defense in fencing, and in bayonet and saber\n   exercise.'),
(34024, 'Guard', 'v. t.', 'An expression or admission intended to secure against\n   objections or censure.'),
(34025, 'Guard', 'v. t.', 'Watch; heed; care; attention; as, to keep guard.'),
(34026, 'Guard', 'v. t.', 'The fibrous sheath which covers the phragmacone of the\n   Belemnites.'),
(34027, 'Guardage', 'v. t.', 'Wardship'),
(34028, 'Guardant', 'v. t.', 'Acting as guardian.'),
(34029, 'Guardant', 'v. t.', 'Same as Gardant.'),
(34030, 'Guardant', 'n.', 'A guardian.'),
(34031, 'Guarded', 'a.', 'Cautious; wary; circumspect; as, he was guarded in his\n   expressions; framed or uttered with caution; as, his expressions were\n   guarded.'),
(34032, 'Guarder', 'n.', 'One who guards.'),
(34033, 'Guardful', 'a.', 'Cautions; wary; watchful.'),
(34034, 'Guardian', 'v. t.', 'One who guards, preserves, or secures; one to whom any\n   person or thing is committed for protection, security, or preservation\n   from injury; a warden.'),
(34035, 'Guardian', 'v. t.', 'One who has, or is entitled to, the custody of the\n   person or property of an infant, a minor without living parents, or a\n   person incapable of managing his own affairs.'),
(34036, 'Guardian', 'a.', 'Performing, or appropriate to, the office of a protector;\n   as, a guardian care.'),
(34037, 'Guards', 'n. pl.', 'A body of picked troops; as, \"The Household Guards.\"'),
(34038, 'Guarish', 'v. t.', 'To heal.'),
(34039, 'Guava', 'n.', 'A tropical tree, or its fruit, of the genus Psidium. Two\n   varieties are well known, the P. pyriferum, or white guava, and P.\n   pomiferum, or red guava. The fruit or berry is shaped like a\n   pomegranate, but is much smaller. It is somewhat astringent, but makes\n   a delicious jelly.'),
(34040, 'Gudgeon', 'n.', 'A small European freshwater fish (Gobio fluviatilis),\n   allied to the carp. It is easily caught and often used for food and for\n   bait. In America the killifishes or minnows are often called gudgeons.'),
(34041, 'Gudgeon', 'n.', 'What may be got without skill or merit.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(34042, 'Gudgeon', 'n.', 'A person easily duped or cheated.'),
(34043, 'Gudgeon', 'n.', 'The pin of iron fastened in the end of a wooden shaft or\n   axle, on which it turns; formerly, any journal, or pivot, or bearing,\n   as the pintle and eye of a hinge, but esp. the end journal of a\n   horizontal.'),
(34044, 'Gudgeon', 'n.', 'A metal eye or socket attached to the sternpost to receive\n   the pintle of the rudder.'),
(34045, 'Gudgeon', 'v. t.', 'To deprive fraudulently; to cheat; to dupe; to impose\n   upon.'),
(34046, 'Gueber', 'n.', 'Alt. of Guebre'),
(34047, 'Guebre', 'n.', 'Same as Gheber.'),
(34048, 'Guelph', 'n.', 'Alt. of Guelf'),
(34049, 'Guelf', 'n.', 'One of a faction in Germany and Italy, in the 12th and 13th\n   centuries, which supported the House of Guelph and the pope, and\n   opposed the Ghibellines, or faction of the German emperors.'),
(34050, 'Guelphic', 'a.', 'Alt. of Guelfic'),
(34051, 'Guelfic', 'a.', 'Of or pertaining to the family or the faction of the\n   Guelphs.'),
(34052, 'Guenon', 'n.', 'One of several long-tailed Oriental monkeys, of the genus\n   Cercocebus, as the green monkey and grivet.'),
(34053, 'Gueparde', 'n.', 'The cheetah.'),
(34054, 'Guerdon', 'n.', 'A reward; requital; recompense; -- used in both a good and\n   a bad sense.'),
(34055, 'Guerdon', 'n.', 'To give guerdon to; to reward; to be a recompense for.'),
(34056, 'Guereza', 'n.', 'A beautiful Abyssinian monkey (Colobus guereza), having\n   the body black, with a fringe of long, silky, white hair along the\n   sides, and a tuft of the same at the end of the tail. The frontal band,\n   cheeks, and chin are white.'),
(34057, 'Guerilla', 'a.', 'See Guerrilla.'),
(34058, 'Guerite', 'n.', 'A projecting turret for a sentry, as at the salient angles\n   of works, or the acute angles of bastions.'),
(34059, 'Guessed', 'imp. & p. p.', 'of Guess'),
(34060, 'Guessing', 'p. pr. & vb. n.', 'of Guess'),
(34061, 'Guess', 'v. t.', 'To form an opinion concerning, without knowledge or means\n   of knowledge; to judge of at random; to conjecture.'),
(34062, 'Guess', 'v. t.', 'To judge or form an opinion of, from reasons that seem\n   preponderating, but are not decisive.'),
(34063, 'Guess', 'v. t.', 'To solve by a correct conjecture; to conjecture rightly;\n   as, he who guesses the riddle shall have the ring; he has guessed my\n   designs.'),
(34064, 'Guess', 'v. t.', 'To hit upon or reproduce by memory.'),
(34065, 'Guess', 'v. t.', 'To think; to suppose; to believe; to imagine; -- followed\n   by an objective clause.'),
(34066, 'Guess', 'v. i.', 'To make a guess or random judgment; to conjecture; --\n   with at, about, etc.'),
(34067, 'Guess', 'n.', 'An opinion as to anything, formed without sufficient or\n   decisive evidence or grounds; an attempt to hit upon the truth by a\n   random judgment; a conjecture; a surmise.'),
(34068, 'Guesser', 'n.', 'One who guesses; one who forms or gives an opinion without\n   means of knowing.'),
(34069, 'Guessive', 'a.', 'Conjectural.'),
(34070, 'Guest', 'n.', 'A visitor; a person received and entertained in one\'s house\n   or at one\'s table; a visitor entertained without pay.'),
(34071, 'Guest', 'v. t.', 'To receive or entertain hospitably.'),
(34072, 'Guest', 'v. i.', 'To be, or act the part of, a guest.'),
(34073, 'Guevi', 'n.', 'One of several very small species and varieties of African\n   antelopes, of the genus Cephalophus, as the Cape guevi or kleeneboc\n   (Cephalophus pygmaea); -- called also pygmy antelope.'),
(34074, 'Guffaw', 'n.', 'A loud burst of laughter; a horse laugh.'),
(34075, 'Guffer', 'n.', 'The eelpout; guffer eel.'),
(34076, 'Guggle', 'v. i.', 'See Gurgle.'),
(34077, 'Guiac', 'n.', 'Same as Guaiac.'),
(34078, 'Guiacol', 'n.', 'A colorless liquid, C6H4,OCH3.OH, resembling the phenols,\n   found as a constituent of woodtar creosote, aud produced by the dry\n   distillation of guaiac resin.'),
(34079, 'Guiacum', 'n.', 'Same as Guaiacum.'),
(34080, 'Guicowar', 'n.', '[Mahratta g/ekw/r, prop., a cowherd.] The title of the\n   sovereign of Guzerat, in Western India; -- generally called the\n   Guicowar of Baroda, which is the capital of the country.'),
(34081, 'Guidable', 'a.', 'Capable of being guided; willing to be guided or\n   counseled.'),
(34082, 'Guidage', 'n.', 'The reward given to a guide for services.'),
(34083, 'Guidage', 'n.', 'Guidance; lead; direction.'),
(34084, 'Guidance', 'n.', 'The act or result of guiding; the superintendence or\n   assistance of a guide; direction; government; a leading.'),
(34085, 'Guided', 'imp. & p. p.', 'of Guide'),
(34086, 'Guiding', 'p. pr. & vb. n.', 'of Guide'),
(34087, 'Guide', 'v. t.', 'To lead or direct in a way; to conduct in a course or\n   path; to pilot; as, to guide a traveler.'),
(34088, 'Guide', 'v. t.', 'To regulate and manage; to direct; to order; to\n   superintend the training or education of; to instruct and influence\n   intellectually or morally; to train.'),
(34089, 'Guide', 'v. t.', 'A person who leads or directs another in his way or\n   course, as in a strange land; one who exhibits points of interest to\n   strangers; a conductor; also, that which guides; a guidebook.'),
(34090, 'Guide', 'v. t.', 'One who, or that which, directs another in his conduct or\n   course of lifo; a director; a regulator.'),
(34091, 'Guide', 'v. t.', 'Any contrivance, especially one having a directing edge,\n   surface, or channel, for giving direction to the motion of anything, as\n   water, an instrument, or part of a machine, or for directing the hand\n   or eye, as of an operator'),
(34092, 'Guide', 'v. t.', 'A blade or channel for directing the flow of water to the\n   wheel buckets.'),
(34093, 'Guide', 'v. t.', 'A grooved director for a probe or knife.'),
(34094, 'Guide', 'v. t.', 'A strip or device to direct the compositor\'s eye to the\n   line of copy he is setting.'),
(34095, 'Guide', 'v. t.', 'A noncommissioned officer or soldier placed on the\n   directiug flank of each subdivision of a column of troops, or at the\n   end of a line, to mark the pivots, formations, marches, and alignments\n   in tactics.'),
(34096, 'Guider', 'n.', 'A guide; a director.'),
(34097, 'Guidguid', 'n.', 'A South American ant bird of the genus Hylactes; --\n   called also barking bird.'),
(34098, 'Guidon', 'v. t.', 'A small flag or streamer, as that carried by cavalry,\n   which is broad at one end and nearly pointed at the other, or that used\n   to direct the movements of a body of infantry, or to make signals at\n   sea; also, the flag of a guild or fraternity. In the United States\n   service, each company of cavalry has a guidon.'),
(34099, 'Guidon', 'v. t.', 'One who carries a flag.'),
(34100, 'Guidon', 'v. t.', 'One of a community established at Rome, by Charlemagne,\n   to guide pilgrims to the Holy Land.'),
(34101, 'Gulge', 'n.', 'See Gige.'),
(34102, 'Guild', 'v. t.', 'An association of men belonging to the same class, or\n   engaged in kindred pursuits, formed for mutual aid and protection; a\n   business fraternity or corporation; as, the Stationers\' Guild; the\n   Ironmongers\' Guild. They were originally licensed by the government,\n   and endowed with special privileges and authority.'),
(34103, 'Guild', 'v. t.', 'A guildhall.'),
(34104, 'Guild', 'v. t.', 'A religious association or society, organized for\n   charitable purposes or for assistance in parish work.'),
(34105, 'Guilder', 'n.', 'A Dutch silver coin worth about forty cents; -- called\n   also florin and gulden.'),
(34106, 'Guile', 'n.', 'Craft; deceitful cunning; artifice; duplicity; wile; deceit;\n   treachery.'),
(34107, 'Guile', 'n.', 'To disguise or conceal; to deceive or delude.'),
(34108, 'Guileful', 'a.', 'Full of guile; characterized by cunning, deceit, or\n   treachery; guilty.'),
(34109, 'Guilor', 'n.', 'A deceiver; one who deludes, or uses guile.'),
