(34353, 'Habitual', 'n.', 'According to habit; established by habit; customary;\n   constant; as, the habiual practice of sin.'),
(34354, 'Habitude', 'n.', 'Habitual attitude; usual or accustomed state with\n   reference to something else; established or usual relations.'),
(34355, 'Habitude', 'n.', 'Habitual association, intercourse, or familiarity.'),
(34356, 'Habitude', 'n.', 'Habit of body or of action.'),
(34357, 'Habitue', 'n.', 'One who habitually frequents a place; as, an habitue of a\n   theater.'),
(34358, 'Habiture', 'n.', 'Habitude.'),
(34359, 'Habitus', 'n.', 'Habitude; mode of life; general appearance.'),
(34360, 'Hable', 'a.', 'See Habile.'),
(34361, 'Habnab', 'adv.', 'By chance.'),
(34362, 'Hachure', 'n.', 'A short line used in drawing and engraving, especially in\n   shading and denoting different surfaces, as in map drawing. See\n   Hatching.'),
(34363, 'Hacienda', 'n.', 'A large estate where work of any kind is done, as\n   agriculture, manufacturing, mining, or raising of animals; a cultivated\n   farm, with a good house, in distinction from a farming establishment\n   with rude huts for herdsmen, etc.; -- a word used in Spanish-American\n   regions.'),
(34364, 'Hacked', 'imp. & p. p.', 'of Hack'),
(34365, 'Hacking', 'p. pr. & vb. n.', 'of Hack'),
(34366, 'Hackbolt', 'n.', 'The greater shearwater or hagdon. See Hagdon.'),
(34367, 'Hackbuss', 'n.', 'Same as Hagbut.'),
(34368, 'Hackee', 'n.', 'The chipmunk; also, the chickaree or red squirrel.'),
(34369, 'Hacker', 'n.', 'One who, or that which, hacks. Specifically: A cutting\n   instrument for making notches; esp., one used for notching pine trees\n   in collecting turpentine; a hack.'),
(34370, 'Hackery', 'n.', 'A cart with wooden wheels, drawn by bullocks.'),
(34371, 'Hackle', 'n.', 'A comb for dressing flax, raw silk, etc.; a hatchel.'),
(34372, 'Hackle', 'n.', 'Any flimsy substance unspun, as raw silk.'),
(34373, 'Hackle', 'n.', 'One of the peculiar, long, narrow feathers on the neck of\n   fowls, most noticeable on the cock, -- often used in making artificial\n   flies; hence, any feather so used.'),
(34374, 'Hackle', 'n.', 'An artificial fly for angling, made of feathers.'),
(34375, 'Hackled', 'imp. & p. p.', 'of Hackle'),
(34376, 'Hackling', 'p. pr. & vb. n.', 'of Hackle'),
(34377, 'Hackle', 'v. t.', 'To separate, as the coarse part of flax or hemp from the\n   fine, by drawing it through the teeth of a hackle or hatchel.'),
(34378, 'Hackle', 'v. t.', 'To tear asunder; to break in pieces.'),
(34379, 'Hackly', 'a.', 'Rough or broken, as if hacked.'),
(34380, 'Hackly', 'a.', 'Having fine, short, and sharp points on the surface; as,\n   the hackly fracture of metallic iron.'),
(34381, 'Hackmen', 'pl. ', 'of Hackman'),
(34382, 'Hackman', 'n.', 'The driver of a hack or carriage for public hire.'),
(34383, 'Hackneys', 'pl. ', 'of Hackney'),
(34384, 'Hackney', 'n.', 'A horse for riding or driving; a nag; a pony.'),
(34385, 'Hackney', 'n.', 'A horse or pony kept for hire.'),
(34386, 'Hackney', 'n.', 'A carriage kept for hire; a hack; a hackney coach.'),
(34387, 'Hackney', 'n.', 'A hired drudge; a hireling; a prostitute.'),
(34388, 'Hackney', 'a.', 'Let out for hire; devoted to common use; hence, much used;\n   trite; mean; as, hackney coaches; hackney authors.'),
(34389, 'Hackney', 'v. t.', 'To devote to common or frequent use, as a horse or\n   carriage; to wear out in common service; to make trite or commonplace;\n   as, a hackneyed metaphor or quotation.'),
(34390, 'Hackney', 'v. t.', 'To carry in a hackney coach.'),
(34391, 'Hackster', 'n.', 'A bully; a bravo; a ruffian; an assassin.'),
(34392, 'Hadder', 'n.', 'Heather; heath.'),
(34393, 'Haddie', 'n.', 'The haddock.'),
(34394, 'Haddock', 'n.', 'A marine food fish (Melanogrammus aeglefinus), allied to\n   the cod, inhabiting the northern coasts of Europe and America. It has a\n   dark lateral line and a black spot on each side of the body, just back\n   of the gills. Galled also haddie, and dickie.'),
(34395, 'Hades', 'n.', 'The nether world (according to classical mythology, the\n   abode of the shades, ruled over by Hades or Pluto); the invisible\n   world; the grave.'),
(34396, 'Hadji', 'n.', 'A Mohammedan pilgrim to Mecca; -- used among Orientals as a\n   respectful salutation or a title of honor.'),
(34397, 'Hadji', 'n.', 'A Greek or Armenian who has visited the holy sepulcher at\n   Jerusalem.'),
(34398, 'Haema-', '', 'Alt. of Haemo-'),
(34399, 'Haemato-', '', 'Alt. of Haemo-'),
(34400, 'Haemo-', '', 'Combining forms indicating relation or resemblance to blood,\n   association with blood; as, haemapod, haematogenesis, haemoscope.'),
(34401, 'Haemad', 'adv.', 'Toward the haemal side; on the haemal side of; -- opposed\n   to neurad.'),
(34402, 'Haemal', 'a.', 'Pertaining to the blood or blood vessels; also, ventral.\n   See Hemal.'),
(34403, 'Haemapod', 'n.', 'An haemapodous animal.'),
(34404, 'Haematic', 'a.', 'Of or pertaining to the blood; sanguine; brownish red.'),
(34405, 'Haematin', 'n.', 'Same as Hematin.'),
(34406, 'Haemato-', 'prefix.', 'See Haema-.'),
(34407, 'Haemic', 'a.', 'Pertaining to the blood; hemal.'),
(34408, 'Haemin', 'n.', 'Same as Hemin.'),
(34409, 'Haemo-', 'prefix.', 'See Haema-.'),
(34410, 'Haemony', 'n.', 'A plant described by Milton as \"of sovereign use against\n   all enchantments.\"'),
(34411, 'Haffle', 'v. i.', 'To stammer; to speak unintelligibly; to prevaricate.'),
(34412, 'Hafter', 'n.', 'A caviler; a wrangler.'),
(34413, 'Hagged', 'imp. & p. p.', 'of Hag'),
(34414, 'Hagging', 'p. pr. & vb. n.', 'of Hag'),
(34415, 'Hagberry', 'n.', 'A plant of the genus Prunus (P. Padus); the bird cherry.'),
(34416, 'Hagborn', 'a.', 'Born of a hag or witch.'),
(34417, 'Hagbut', 'n.', 'A harquebus, of which the but was bent down or hooked for\n   convenience in taking aim.'),
(34418, 'Hagdon', 'n.', 'One of several species of sea birds of the genus Puffinus;\n   esp., P. major, the greater shearwarter, and P. Stricklandi, the black\n   hagdon or sooty shearwater; -- called also hagdown, haglin, and hag.\n   See Shearwater.'),
(34419, 'Haggada', 'n.', 'A story, anecdote, or legend in the Talmud, to explain or\n   illustrate the text of the Old Testament.'),
(34420, 'Haggard', 'a.', 'Wild or intractable; disposed to break away from duty;\n   untamed; as, a haggard or refractory hawk.'),
(34421, 'Haggard', 'a.', 'Having the expression of one wasted by want or suffering;\n   hollow-eyed; having the features distorted or wasted, or anxious in\n   appearance; as, haggard features, eyes.'),
(34422, 'Haggard', 'a.', 'A young or untrained hawk or falcon.'),
(34423, 'Haggard', 'a.', 'A fierce, intractable creature.'),
(34424, 'Haggard', 'a.', 'A hag.'),
(34425, 'Haggard', 'n.', 'A stackyard.'),
(34426, 'Hagged', 'a.', 'Like a hag; lean; ugly.'),
(34427, 'Haggis', 'n.', 'A Scotch pudding made of the heart, liver, lights, etc., of\n   a sheep or lamb, minced with suet, onions, oatmeal, etc., highly\n   seasoned, and boiled in the stomach of the same animal; minced head and\n   pluck.'),
(34428, 'Haggish', 'a.', 'Like a hag; ugly; wrinkled.'),
(34429, 'Haggled', 'imp. & p. p.', 'of Haggle'),
(34430, 'Haggling', 'p. pr. & vb. n.', 'of Haggle'),
(34431, 'Haggle', 'v. t.', 'To cut roughly or hack; to cut into small pieces; to\n   notch or cut in an unskillful manner; to make rough or mangle by\n   cutting; as, a boy haggles a stick of wood.'),
(34432, 'Haggle', 'v. i.', 'To be difficult in bargaining; to stick at small\n   matters; to chaffer; to higgle.'),
(34433, 'Haggle', 'n.', 'The act or process of haggling.'),
(34434, 'Haggler', 'n.', 'One who haggles or is difficult in bargaining.'),
(34435, 'Haggler', 'n.', 'One who forestalls a market; a middleman between producer\n   and dealer in London vegetable markets.'),
(34436, 'Hagseed', 'n.', 'The offspring of a hag.'),
(34437, 'Hagship', 'n.', 'The state or title of a hag.'),
(34438, 'Haguebut', 'n.', 'See Hagbut.'),
(34439, 'Ha-ha', 'n.', 'A sunk fence; a fence, wall, or ditch, not visible till one\n   is close upon it.'),
(34440, 'Haiduck', 'n.', 'Formerly, a mercenary foot soldier in Hungary, now, a\n   halberdier of a Hungarian noble, or an attendant in German or Hungarian\n   courts.'),
(34441, 'Haikal', 'n.', 'The central chapel of the three forming the sanctuary of a\n   Coptic church. It contains the high altar, and is usually closed by an\n   embroidered curtain.'),
(34442, 'Halled', 'imp. & p. p.', 'of Hail'),
(34443, 'Halting', 'p. pr. & vb. n.', 'of Hail'),
(34444, 'Hailse', 'v. t.', 'To greet; to salute.'),
(34445, 'Hailshot', 'n. pl.', 'Small shot which scatter like hailstones.'),
(34446, 'Haily', 'a.', 'Of hail.'),
(34447, 'Haint', '', 'A contraction of have not or has not; as, I hain\'t, he\n   hain\'t, we hain\'t.'),
(34448, 'Hairbell', 'n.', 'See Harebell.'),
(34449, 'Hairbird', 'n.', 'The chipping sparrow.'),
(34450, 'Haired', 'a.', 'Having hair.'),
(34451, 'Haired', 'a.', 'In composition: Having (such) hair; as, red-haired.'),
(34452, 'Hairen', 'a.', 'Hairy.'),
(34453, 'Hairless', 'a.', 'Destitute of hair.'),
(34454, 'Hairpin', 'n.', 'A pin, usually forked, or of bent wire, for fastening the\n   hair in place, -- used by women.'),
(34455, 'Hairtail', 'n.', 'Any species of marine fishes of the genus Trichiurus;\n   esp., T. lepterus of Europe and America. They are long and like a band,\n   with a slender, pointed tail. Called also bladefish.'),
(34456, 'Hairworm', '', 'A nematoid worm of the genus Gordius, resembling a hair.\n   See Gordius.'),
(34457, 'Hairy', 'a.', 'Bearing or covered with hair; made of or resembling hair;\n   rough with hair; rough with hair; rough with hair; hirsute.'),
(34458, 'Haitian', 'a. & n.', 'See Haytian.'),
(34459, 'Haketon', 'n.', 'Same as Acton.'),
(34460, 'Hakim', 'n.', 'A wise man; a physician, esp. a Mohammedan.'),
(34461, 'Hakim', 'n.', 'A Mohammedan title for a ruler; a judge.'),
(34462, 'Halacha', 'n.', 'The general term for the Hebrew oral or traditional law;\n   one of two branches of exposition in the Midrash. See Midrash.'),
(34463, 'Halation', 'n.', 'An appearance as of a halo of light, surrounding the\n   edges of dark objects in a photographic picture.'),
(34464, 'Halberd', 'n.', 'An ancient long-handled weapon, of which the head had a\n   point and several long, sharp edges, curved or straight, and sometimes\n   additional points. The heads were sometimes of very elaborate form.'),
(34465, 'Halcyon', 'n.', 'A kingfisher. By modern ornithologists restricted to a\n   genus including a limited number of species having omnivorous habits,\n   as the sacred kingfisher (Halcyon sancta) of Australia.'),
(34466, 'Halcyon', 'a.', 'Pertaining to, or resembling, the halcyon, which was\n   anciently said to lay her eggs in nests on or near the sea during the\n   calm weather about the winter solstice.'),
(34467, 'Halcyon', 'a.', 'Hence: Calm; quiet; peaceful; undisturbed; happy.'),
(34468, 'Haled', 'imp. & p. p.', 'of Hale'),
(34469, 'Haling', 'p. pr. & vb. n.', 'of Hale'),
(34470, 'Halesia', 'n.', 'A genus of American shrubs containing several species,\n   called snowdrop trees, or silver-bell trees. They have showy, white\n   flowers, drooping on slender pedicels.'),
(34471, 'Halves', 'pl. ', 'of Half'),
(34472, 'Halfbeak', 'n.', 'Any slender, marine fish of the genus Hemirhamphus,\n   having the upper jaw much shorter than the lower; -- called also\n   balahoo.'),
(34473, 'Halfcock', 'v. t.', 'To set the cock of (a firearm) at the first notch.'),
(34474, 'Halfen', 'a.', 'Wanting half its due qualities.'),
(34475, 'Halfer', 'n.', 'One who possesses or gives half only; one who shares.'),
(34476, 'Halfer', 'n.', 'A male fallow deer gelded.'),
(34477, 'Halfness', 'n.', 'The quality of being half; incompleteness.'),
(34478, 'Halfpace', 'n.', 'A platform of a staircase where the stair turns back in\n   exactly the reverse direction of the lower flight. See Quarterpace.'),
(34479, 'Half-ray', 'n.', 'A straight line considered as drawn from a center to an\n   indefinite distance in one direction, the complete ray being the whole\n   line drawn to an indefinite distance in both directions.'),
(34480, 'Halfway', 'adv.', 'In the middle; at half the distance; imperfectly;\n   partially; as, he halfway yielded.'),
(34481, 'Halfway', 'a.', 'Equally distant from the extremes; situated at an\n   intermediate point; midway.'),
(34482, 'Half-wit', 'n.', 'A foolish; a dolt; a blockhead; a dunce.'),
(34483, 'Halibut', 'n.', 'A large, northern, marine flatfish (Hippoglossus\n   vulgaris), of the family Pleuronectidae. It often grows very large,\n   weighing more than three hundred pounds. It is an important food fish.'),
(34484, 'Halicore', 'n.', 'Same as Dugong.'),
(34485, 'Halidom', 'n.', 'Holiness; sanctity; sacred oath; sacred things; sanctuary;\n   -- used chiefly in oaths.'),
(34486, 'Halidom', 'n.', 'Holy doom; the Last Day.'),
(34487, 'Halmas', 'a.', 'The feast of All Saints; Hallowmas.'),
(34488, 'Haliotis', 'n.', 'A genus of marine shells; the ear-shells. See Abalone.'),
(34489, 'Halite', 'n.', 'Native salt; sodium chloride.'),
(34490, 'Hallage', 'n.', 'A fee or toll paid for goods sold in a hall.'),
(34491, 'Halliard', 'n.', 'See Halyard.'),
(34492, 'Hallier', 'n.', 'A kind of net for catching birds.'),
(34493, 'Halloa', '', 'See Halloo.'),
(34494, 'Halloo', 'n.', 'A loud exclamation; a call to invite attention or to incite\n   a person or an animal; a shout.'),
(34495, 'Hallooed', 'imp. & p. p.', 'of Halloo'),
(34496, 'Halloing', 'p. pr. & vb. n.', 'of Halloo'),
(34497, 'Halloo', 'v. i.', 'To cry out; to exclaim with a loud voice; to call to a\n   person, as by the word halloo.'),
(34498, 'Halloo', 'v. t.', 'To encourage with shouts.'),
(34499, 'Halloo', 'v. t.', 'To chase with shouts or outcries.'),
(34500, 'Halloo', 'v. t.', 'To call or shout to; to hail.'),
(34501, 'Halloo', 'n.', 'An exclamation to call attention or to encourage one.'),
(34502, 'Hallowed', 'imp. & p. p.', 'of Hallow'),
(34503, 'Hallow', 'v. t.', 'To make holy; to set apart for holy or religious use; to\n   consecrate; to treat or keep as sacred; to reverence.'),
(34504, 'Hallucal', 'a.', 'Of or pertaining to the hallux.'),
(34505, 'Hallux', 'n.', 'The first, or preaxial, digit of the hind limb,\n   corresponding to the pollux in the fore limb; the great toe; the hind\n   toe of birds.'),
(34506, 'Halma', 'n.', 'The long jump, with weights in the hands, -- the most\n   important of the exercises of the Pentathlon.'),
(34507, 'Halos', 'pl. ', 'of Halo'),
(34508, 'Haloed', 'imp. & p. p.', 'of Halo'),
(34509, 'Haloing', 'p. pr. & vb. n.', 'of Halo'),
(34510, 'Haloed', 'a.', 'Surrounded with a halo; invested with an ideal glory;\n   glorified.'),
(34511, 'Halogen', 'n.', 'An electro-negative element or radical, which, by\n   combination with a metal, forms a haloid salt; especially, chlorine,\n   bromine, and iodine; sometimes, also, fluorine and cyanogen. See\n   Chlorine family, under Chlorine.'),
(34512, 'Haloid', 'a.', 'Resembling salt; -- said of certain binary compounds\n   consisting of a metal united to a negative element or radical, and now\n   chiefly applied to the chlorides, bromides, iodides, and sometimes also\n   to the fluorides and cyanides.'),
(34513, 'Haloid', 'n.', 'A haloid substance.'),
(34514, 'Halones', 'n. pl.', 'Alternating transparent and opaque white rings which\n   are seen outside the blastoderm, on the surface of the developing egg\n   of the hen and other birds.'),
(34515, 'Halpace', 'n.', 'See Haut pas.'),
(34516, 'Halse', 'v. t.', 'To embrace about the neck; to salute; to greet.'),
(34517, 'Halse', 'v. t.', 'To adjure; to beseech; to entreat.'),
(34518, 'Halsed', 'imp. & p. p.', 'of Halse'),
(34519, 'Halsing', 'p. pr. & vb. n.', 'of Halse'),
(34520, 'Halse', 'v. t.', 'To haul; to hoist.'),
(34521, 'Halser', 'n.', 'See Hawser.'),
(34522, 'Halted', 'imp. & p. p.', 'of Halt'),
(34523, 'Halting', 'p. pr. & vb. n.', 'of Halt'),
(34524, 'Halter', 'n.', 'One who halts or limps; a cripple.'),
(34525, 'Halter', 'n.', 'A strong strap or cord.'),
(34526, 'Halter', 'n.', 'A rope or strap, with or without a headstall, for leading\n   or tying a horse.'),
(34527, 'Halter', 'n.', 'A rope for hanging malefactors; a noose.'),
(34528, 'Haltered', 'imp. & p. p.', 'of Halter'),
(34529, 'Halter', 'v. t.', 'To tie by the neck with a rope, strap, or halter; to put\n   a halter on; to subject to a hangman\'s halter.'),
(34530, 'Halteres', 'n. pl.', 'Balancers; the rudimentary hind wings of Diptera.'),
(34531, 'Halvans', 'n. pl.', 'Impure ore; dirty ore.'),
(34532, 'Halve', 'n.', 'A half.'),
(34533, 'Halved', 'imp. & p. p.', 'of Halve'),
(34534, 'Halving', 'p. pr. & vb. n.', 'of Halve'),
(34535, 'Halve', 'v. t.', 'To divide into two equal parts; as, to halve an apple; to\n   be or form half of.'),
(34536, 'Halve', 'v. t.', 'To join, as two pieces of timber, by cutting away each\n   for half its thickness at the joining place, and fitting together.'),
(34537, 'Halved', 'a.', 'Appearing as if one side, or one half, were cut away;\n   dimidiate.'),
(34538, 'Halves', 'n.', 'pl. of Half.'),
(34539, 'Halwe', 'n.', 'A saint.'),
(34540, 'Halyard', 'v. t.', 'A rope or tackle for hoisting or lowering yards,\n   sails, flags, etc.'),
(34541, 'Hamate', 'a.', 'Hooked; bent at the end into a hook; hamous.'),
(34542, 'Hamated', 'a.', 'Hooked, or set with hooks; hamate.'),
(34543, 'Hamatum', 'n.', 'See Unciform.'),
(34544, 'Hamble', 'v. t.', 'To hamstring.'),
(34545, 'Hamburg', 'n.', 'A commercial city of Germany, near the mouth of the Elbe.'),
(34546, 'Hamel', 'v. t.', 'Same as Hamele.'),
(34547, 'Hamiform', 'n.', 'Hook-shaped.'),
(34548, 'Haminura', 'n.', 'A large edible river fish (Erythrinus macrodon) of\n   Guiana.'),
(34549, 'Hamite', 'n.', 'A fossil cephalopod of the genus Hamites, related to the\n   ammonites, but having the last whorl bent into a hooklike form.'),
(34550, 'Hamite', 'n.', 'A descendant of Ham, Noah\'s second son. See Gen. x. 6-20.'),
(34551, 'Haitic', 'a.', 'Pertaining to Ham or his descendants.'),
(34552, 'Hamlet', 'n.', 'A small village; a little cluster of houses in the country.'),
(34553, 'Hamleted', 'p. a.', 'Confined to a hamlet.'),
(34554, 'Hammer', 'n.', 'An instrument for driving nails, beating metals, and the\n   like, consisting of a head, usually of steel or iron, fixed crosswise\n   to a handle.'),
(34555, 'Hammer', 'n.', 'Something which in firm or action resembles the common\n   hammer'),
(34556, 'Hammer', 'n.', 'That part of a clock which strikes upon the bell to\n   indicate the hour.'),
(34557, 'Hammer', 'n.', 'The padded mallet of a piano, which strikes the wires, to\n   produce the tones.'),
(34558, 'Hammer', 'n.', 'The malleus.'),
(34559, 'Hammer', 'n.', 'That part of a gunlock which strikes the percussion cap, or\n   firing pin; the cock; formerly, however, a piece of steel covering the\n   pan of a flintlock musket and struck by the flint of the cock to ignite\n   the priming.'),
(34560, 'Hammer', 'n.', 'Also, a person of thing that smites or shatters; as, St.\n   Augustine was the hammer of heresies.'),
(34561, 'Hammered', 'imp. & p. p.', 'of Hammer'),
(34562, 'Hammer', 'v. t.', 'To beat with a hammer; to beat with heavy blows; as, to\n   hammer iron.'),
(34563, 'Hammer', 'v. t.', 'To form or forge with a hammer; to shape by beating.'),
(34564, 'Hammer', 'v. t.', 'To form in the mind; to shape by hard intellectual\n   labor; -- usually with out.'),
(34565, 'Hammer', 'v. i.', 'To be busy forming anything; to labor hard as if shaping\n   something with a hammer.'),
(34566, 'Hammer', 'v. i.', 'To strike repeated blows, literally or figuratively.'),
(34567, 'Hammerer', 'n.', 'One who works with a hammer.'),
(34568, 'Hammock', 'n.', 'A swinging couch or bed, usually made of netting or canvas\n   about six feet wide, suspended by clews or cords at the ends.'),
(34569, 'Hammock', 'n.', 'A piece of land thickly wooded, and usually covered with\n   bushes and vines. Used also adjectively; as, hammock land.'),
(34570, 'Hamose', '', 'Alt. of Hamous'),
(34571, 'Hamous', '', 'Having the end hooked or curved.'),
(34572, 'Hamper', 'n.', 'A large basket, usually with a cover, used for the packing\n   and carrying of articles; as, a hamper of wine; a clothes hamper; an\n   oyster hamper, which contains two bushels.'),
(34573, 'Hampered', 'imp. & p. p.', 'of Hamper'),
(34574, 'Hamper', 'v. t.', 'To put in a hamper.'),
(34575, 'Hamper', 'v. t.', 'To put a hamper or fetter on; to shackle; to insnare; to\n   inveigle; hence, to impede in motion or progress; to embarrass; to\n   encumber.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(34576, 'Hamper', 'n.', 'A shackle; a fetter; anything which impedes.'),
(34577, 'Hamper', 'n.', 'Articles ordinarily indispensable, but in the way at\n   certain times.'),
(34578, 'Hamster', 'n.', 'A small European rodent (Cricetus frumentarius). It is\n   remarkable for having a pouch on each side of the jaw, under the skin,\n   and for its migrations.'),
(34579, 'Hamular', 'a.', 'Hooked; hooklike; hamate; as, the hamular process of the\n   sphenoid bone.'),
(34580, 'Hamulate', 'a.', 'Furnished with a small hook; hook-shaped.'),
(34581, 'Hamule', 'n.', 'A little hook.'),
(34582, 'Hamulose', 'a.', 'Bearing a small hook at the end.'),
(34583, 'Hamuli', 'pl. ', 'of Hamulus'),
(34584, 'Hamulus', 'n.', 'A hook, or hooklike process.'),
(34585, 'Hamulus', 'n.', 'A hooked barbicel of a feather.'),
(34586, 'Hanap', 'n.', 'A rich goblet, esp. one used on state occasions.'),
(34587, 'Hanaper', 'n.', 'A kind of basket, usually of wickerwork, and adapted for\n   the packing and carrying of articles; a hamper.'),
(34588, 'Hance', 'v. t.', 'To raise; to elevate.'),
(34589, 'Hance', '', 'Alt. of Hanch'),
(34590, 'Hanch', '', 'See Hanse.'),
(34591, 'Hanch', '', 'A sudden fall or break, as the fall of the fife rail down to\n   the gangway.'),
(34592, 'Handed', 'imp. & p. p.', 'of Hand'),
(34593, 'Handing', 'p. pr. & vb. n.', 'of Hand'),
(34594, 'Handbill', 'n.', 'A loose, printed sheet, to be distributed by hand.'),
(34595, 'Handbill', 'n.', 'A pruning hook.'),
(34596, 'Handbook', 'n.', 'A book of reference, to be carried in the hand; a manual;\n   a guidebook.'),
(34597, 'Handcart', 'n.', 'A cart drawn or pushed by hand.'),
(34598, 'Handcuff', 'n.', 'A fastening, consisting of an iron ring around the wrist,\n   usually connected by a chain with one on the other wrist; a manacle; --\n   usually in the plural.'),
