(35074, 'Hazel', 'a.', 'Of a light brown color, like the hazelnut.'),
(35075, 'Hazeless', 'a.', 'Destitute of haze.'),
(35076, 'Hazelly', 'a.', 'Of the color of the hazelnut; of a light brown.'),
(35077, 'Hazelnut', 'n.', 'The nut of the hazel.'),
(35078, 'Hazily', 'adv.', 'In a hazy manner; mistily; obscurely; confusedly.'),
(35079, 'Haziness', 'n.', 'The quality or state of being hazy.'),
(35080, 'Hazle', 'v. t.', 'To make dry; to dry.'),
(35081, '-head', 'suffix.', 'A variant of -hood.'),
(35082, 'Headed', 'imp. & p. p.', 'of Head'),
(35083, 'Heading', 'p. pr. & vb. n.', 'of Head'),
(35084, 'Headache', 'n.', 'Pain in the head; cephalalgia.'),
(35085, 'Headachy', 'a.', 'Afflicted with headache.'),
(35086, 'Headband', 'n.', 'A fillet; a band for the head.'),
(35087, 'Headband', 'n.', 'The band at each end of the back of a book.'),
(35088, 'Headed', 'a.', 'Furnished with a head (commonly as denoting intellectual\n   faculties); -- used in composition; as, clear-headed, long-headed,\n   thick-headed; a many-headed monster.'),
(35089, 'Headed', 'a.', 'Formed into a head; as, a headed cabbage.'),
(35090, 'Header', 'n.', 'One who, or that which, heads nails, rivets, etc., esp. a\n   machine for heading.'),
(35091, 'Header', 'n.', 'One who heads a movement, a party, or a mob; head; chief;\n   leader.'),
(35092, 'Header', 'n.', 'A brick or stone laid with its shorter face or head in the\n   surface of the wall.'),
(35093, 'Header', 'n.', 'In framing, the piece of timber fitted between two\n   trimmers, and supported by them, and carrying the ends of the\n   tailpieces.'),
(35094, 'Header', 'n.', 'A reaper for wheat, that cuts off the heads only.'),
(35095, 'Header', 'n.', 'A fall or plunge headforemost, as while riding a bicycle,\n   or in bathing; as, to take a header.'),
(35096, 'Headfish', 'n.', 'The sunfish (Mola).'),
(35097, 'Headgear', 'n.', 'Headdress.'),
(35098, 'Headgear', 'n.', 'Apparatus above ground at the mouth of a mine or deep\n   well.'),
(35099, 'Headily', 'adv.', 'In a heady or rash manner; hastily; rashly; obstinately.'),
(35100, 'Heading', 'n.', 'The act or state of one who, or that which, heads;\n   formation of a head.'),
(35101, 'Heading', 'n.', 'That which stands at the head; title; as, the heading of a\n   paper.'),
(35102, 'Heading', 'n.', 'Material for the heads of casks, barrels, etc.'),
(35103, 'Heading', 'n.', 'A gallery, drift, or adit in a mine; also, the end of a\n   drift or gallery; the vein above a drift.'),
(35104, 'Heading', 'n.', 'The extension of a line ruffling above the line of stitch.'),
(35105, 'Heading', 'n.', 'That end of a stone or brick which is presented outward.'),
(35106, 'Headland', 'n.', 'A cape; a promontory; a point of land projecting into the\n   sea or other expanse of water.'),
(35107, 'Headland', 'n.', 'A ridge or strip of unplowed at the ends of furrows, or\n   near a fence.'),
(35108, 'Headless', 'a.', 'Having no head; beheaded; as, a headless body, neck, or\n   carcass.'),
(35109, 'Headless', 'a.', 'Destitute of a chief or leader.'),
(35110, 'Headless', 'a.', 'Destitute of understanding or prudence; foolish; rash;\n   obstinate.'),
(35111, 'Headline', 'n.', 'The line at the head or top of a page.'),
(35112, 'Headline', 'n.', 'See Headrope.'),
(35113, 'Headlong', 'a. & adv.', 'With the head foremost; as, to fall headlong.'),
(35114, 'Headlong', 'a. & adv.', 'Rashly; precipitately; without deliberation.'),
(35115, 'Headlong', 'a. & adv.', 'Hastily; without delay or respite.'),
(35116, 'Headlong', 'a.', 'Rash; precipitate; as, headlong folly.'),
(35117, 'Headlong', 'a.', 'Steep; precipitous.'),
(35118, 'Headmen', 'pl. ', 'of Headman'),
(35119, 'Headman', 'n.', 'A head or leading man, especially of a village community.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(35120, 'Headmost', 'a.', 'Most advanced; most forward; as, the headmost ship in a\n   fleet.'),
(35121, 'Headnote', 'n.', 'A note at the head of a page or chapter; in law reports,\n   an abstract of a case, showing the principles involved and the opinion\n   of the court.'),
(35122, 'Headpan', 'n.', 'The brainpan.'),
(35123, 'Headrace', 'n.', 'See Race, a water course.'),
(35124, 'Headroom', 'n.', 'See Headway, 2.'),
(35125, 'Headrope', 'n.', 'That part of a boltrope which is sewed to the upper edge\n   or head of a sail.'),
(35126, 'Headsail', 'n.', 'Any sail set forward of the foremast.'),
(35127, 'Headship', 'n.', 'Authority or dignity; chief place.'),
(35128, 'Headsmen', 'pl. ', 'of Headsman'),
(35129, 'Headsman', 'n.', 'An executioner who cuts off heads.'),
(35130, 'Headtire', 'n.', 'A headdress.'),
(35131, 'Headtire', 'n.', 'The manner of dressing the head, as at a particular time\n   and place.'),
(35132, 'Headway', 'n.', 'The progress made by a ship in motion; hence, progress or\n   success of any kind.'),
(35133, 'Headway', 'n.', 'Clear space under an arch, girder, and the like,\n   sufficient to allow of easy passing underneath.'),
(35134, 'Headwork', 'n.', 'Mental labor.'),
(35135, 'Heady', 'a.', 'Willful; rash; precipitate; hurried on by will or passion;\n   ungovernable.'),
(35136, 'Heady', 'a.', 'Apt to affect the head; intoxicating; strong.'),
(35137, 'Heady', 'a.', 'Violent; impetuous.'),
(35138, 'Healed', 'imp. & p. p.', 'of Heal'),
(35139, 'Healing', 'p. pr. & vb. n.', 'of Heal'),
(35140, 'Healable', 'a.', 'Capable of being healed.'),
(35141, 'Healall', 'n.', 'A common herb of the Mint family (Brunela vulgaris),\n   destitute of active properties, but anciently thought a panacea.'),
(35142, 'Heald', 'n.', 'A heddle.'),
(35143, 'Healful', 'a.', 'Tending or serving to heal; healing.'),
(35144, 'Healing', 'a.', 'Tending to cure; soothing; mollifying; as, the healing\n   art; a healing salve; healing words.'),
(35145, 'Health', 'n.', 'The state of being hale, sound, or whole, in body, mind, or\n   soul; especially, the state of being free from physical disease or\n   pain.'),
(35146, 'Health', 'n.', 'A wish of health and happiness, as in pledging a person in\n   a toast.'),
(35147, 'Healthy', 'superl.', 'Being in a state of health; enjoying health; hale;\n   sound; free from disease; as, a healthy chid; a healthy plant.'),
(35148, 'Healthy', 'superl.', 'Evincing health; as, a healthy pulse; a healthy\n   complexion.'),
(35149, 'Healthy', 'superl.', 'Conducive to health; wholesome; salubrious; salutary;\n   as, a healthy exercise; a healthy climate.'),
(35150, 'Heaped', 'imp. & p. p.', 'of Heap'),
(35151, 'Heaping', 'p. pr. & vb. n.', 'of Heap'),
(35152, 'Heaper', 'n.', 'One who heaps, piles, or amasses.'),
(35153, 'Heapy', 'a.', 'Lying in heaps.'),
(35154, 'Heard', 'imp. & p. p.', 'of Hear'),
(35155, 'Hearing', 'p. pr. & vb. n.', 'of Hear'),
(35156, 'Heard', '', 'imp. & p. p. of Hear.'),
(35157, 'Hearer', 'n.', 'One who hears; an auditor.'),
(35158, 'Hearing', 'n.', 'The act or power of perceiving sound; perception of sound;\n   the faculty or sense by which sound is perceived; as, my hearing is\n   good.'),
(35159, 'Hearing', 'n.', 'Attention to what is delivered; opportunity to be heard;\n   audience; as, I could not obtain a hearing.'),
(35160, 'Hearing', 'n.', 'A listening to facts and evidence, for the sake of\n   adjudication; a session of a court for considering proofs and\n   determining issues.'),
(35161, 'Hearing', 'n.', 'Extent within which sound may be heard; sound; earshot.'),
(35162, 'Hearken', 'v. i.', 'To listen; to lend the ear; to attend to what is\n   uttered; to give heed; to hear, in order to obey or comply.'),
(35163, 'Hearken', 'v. i.', 'To inquire; to seek information.'),
(35164, 'Hearken', 'v. t.', 'To hear by listening.'),
(35165, 'Hearken', 'v. t.', 'To give heed to; to hear attentively.'),
(35166, 'Hearsal', 'n.', 'Rehearsal.'),
(35167, 'Hearsay', 'n.', 'Report; rumor; fame; common talk; something heard from\n   another.'),
(35168, 'Hearse', 'n.', 'A hind in the year of its age.'),
(35169, 'Hearse', 'n.', 'A framework of wood or metal placed over the coffin or tomb\n   of a deceased person, and covered with a pall; also, a temporary canopy\n   bearing wax lights and set up in a church, under which the coffin was\n   placed during the funeral ceremonies.'),
(35170, 'Hearse', 'n.', 'A grave, coffin, tomb, or sepulchral monument.'),
(35171, 'Hearse', 'n.', 'A bier or handbarrow for conveying the dead to the grave.'),
(35172, 'Hearse', 'n.', 'A carriage specially adapted or used for conveying the dead\n   to the grave.'),
(35173, 'Hearse', 'v. t.', 'To inclose in a hearse; to entomb.'),
(35174, 'Heart', 'n.', 'A hollow, muscular organ, which, by contracting\n   rhythmically, keeps up the circulation of the blood.'),
(35175, 'Heart', 'n.', 'The seat of the affections or sensibilities, collectively or\n   separately, as love, hate, joy, grief, courage, and the like; rarely,\n   the seat of the understanding or will; -- usually in a good sense, when\n   no epithet is expressed; the better or lovelier part of our nature; the\n   spring of all our actions and purposes; the seat of moral life and\n   character; the moral affections and character itself; the individual\n   disposition and character; as, a good, tender, loving, bad, hard, or\n   selfish heart.'),
(35176, 'Heart', 'n.', 'The nearest the middle or center; the part most hidden and\n   within; the inmost or most essential part of any body or system; the\n   source of life and motion in any organization; the chief or vital\n   portion; the center of activity, or of energetic or efficient action;\n   as, the heart of a country, of a tree, etc.'),
(35177, 'Heart', 'n.', 'Courage; courageous purpose; spirit.'),
(35178, 'Heart', 'n.', 'Vigorous and efficient activity; power of fertile\n   production; condition of the soil, whether good or bad.'),
(35179, 'Heart', 'n.', 'That which resembles a heart in shape; especially, a\n   roundish or oval figure or object having an obtuse point at one end,\n   and at the other a corresponding indentation, -- used as a symbol or\n   representative of the heart.'),
(35180, 'Heart', 'n.', 'One of a series of playing cards, distinguished by the\n   figure or figures of a heart; as, hearts are trumps.'),
(35181, 'Heart', 'n.', 'Vital part; secret meaning; real intention.'),
(35182, 'Heart', 'n.', 'A term of affectionate or kindly and familiar address.'),
(35183, 'Heart', 'v. t.', 'To give heart to; to hearten; to encourage; to inspirit.'),
(35184, 'Heart', 'v. i.', 'To form a compact center or heart; as, a hearting\n   cabbage.'),
(35185, 'Hearted', 'a.', 'Having a heart; having (such) a heart (regarded as the\n   seat of the affections, disposition, or character).'),
(35186, 'Hearted', 'a.', 'Shaped like a heart; cordate.'),
(35187, 'Hearted', 'a.', 'Seated or laid up in the heart.'),
(35188, 'Hearten', 'v. t.', 'To encourage; to animate; to incite or stimulate the\n   courage of; to embolden.'),
(35189, 'Hearten', 'v. t.', 'To restore fertility or strength to, as to land.'),
(35190, 'Hearth', 'n.', 'The pavement or floor of brick, stone, or metal in a\n   chimney, on which a fire is made; the floor of a fireplace; also, a\n   corresponding part of a stove.'),
(35191, 'Hearth', 'n.', 'The house itself, as the abode of comfort to its inmates\n   and of hospitality to strangers; fireside.'),
(35192, 'Hearth', 'n.', 'The floor of a furnace, on which the material to be heated\n   lies, or the lowest part of a melting furnace, into which the melted\n   material settles.'),
(35193, 'Heartily', 'adv.', 'From the heart; with all the heart; with sincerity.'),
(35194, 'Heartily', 'adv.', 'With zeal; actively; vigorously; willingly; cordially;\n   as, he heartily assisted the prince.'),
(35195, 'Heartlet', 'n.', 'A little heart.'),
(35196, 'Heartpea', 'n.', 'Same as Heartseed.'),
(35197, 'Hearty', 'superl.', 'Pertaining to, or proceeding from, the heart; warm;\n   cordial; bold; zealous; sincere; willing; also, energetic; active;\n   eager; as, a hearty welcome; hearty in supporting the government.'),
(35198, 'Hearty', 'superl.', 'Exhibiting strength; sound; healthy; firm; not weak;\n   as, a hearty timber.'),
(35199, 'Hearty', 'superl.', 'Promoting strength; nourishing; rich; abundant; as,\n   hearty food; a hearty meal.'),
(35200, 'Hearties', 'pl. ', 'of Hearty'),
(35201, 'Hearty', 'n.', 'Comrade; boon companion; good fellow; -- a term of familiar\n   address and fellowship among sailors.'),
(35202, 'Heated', 'imp. & p. p.', 'of Heat'),
(35203, 'Heating', 'p. pr. & vb. n.', 'of Heat'),
(35204, 'Heater', 'n.', 'One who, or that which, heats.'),
(35205, 'Heater', 'n.', 'Any contrivance or implement, as a furnace, stove, or other\n   heated body or vessel, etc., used to impart heat to something, or to\n   contain something to be heated.'),
(35206, 'Heath', 'n.', 'A low shrub (Erica, / Calluna, vulgaris), with minute\n   evergreen leaves, and handsome clusters of pink flowers. It is used in\n   Great Britain for brooms, thatch, beds for the poor, and for heating\n   ovens. It is also called heather, and ling.'),
(35207, 'Heath', 'n.', 'Also, any species of the genus Erica, of which several are\n   European, and many more are South African, some of great beauty. See\n   Illust. of Heather.'),
(35208, 'Heath', 'n.', 'A place overgrown with heath; any cheerless tract of country\n   overgrown with shrubs or coarse herbage.'),
(35209, 'Heathens', 'pl. ', 'of Heathen'),
(35210, 'Heathen', 'pl. ', 'of Heathen'),
(35211, 'Heathen', 'n.', 'An individual of the pagan or unbelieving nations, or\n   those which worship idols and do not acknowledge the true God; a pagan;\n   an idolater.'),
(35212, 'Heathen', 'n.', 'An irreligious person.'),
(35213, 'Heathen', 'a.', 'Gentile; pagan; as, a heathen author.'),
(35214, 'Heathen', 'a.', 'Barbarous; unenlightened; heathenish.'),
(35215, 'Heathen', 'a.', 'Irreligious; scoffing.'),
(35216, 'Heather', 'n.', 'Heath.'),
(35217, 'Heathery', 'a.', 'Heathy; abounding in heather; of the nature of heath.'),
(35218, 'Heathy', 'a.', 'Full of heath; abounding with heath; as, heathy land;\n   heathy hills.'),
(35219, 'Heating', 'a.', 'That heats or imparts heat; promoting warmth or heat;\n   exciting action; stimulating; as, heating medicines or applications.'),
(35220, 'Heatless', 'a.', 'Destitute of heat; cold.'),
(35221, 'Heaved', 'imp.', 'of Heave'),
(35222, 'Heaved', 'p. p.', 'of Heave'),
(35223, 'Hoven', '', 'of Heave'),
(35224, 'Heaving', 'p. pr. & vb. n.', 'of Heave'),
(35225, 'Heave', 'v. t.', 'To cause to move upward or onward by a lifting effort; to\n   lift; to raise; to hoist; -- often with up; as, the wave heaved the\n   boat on land.'),
(35226, 'Heave', 'v. t.', 'To throw; to cast; -- obsolete, provincial, or\n   colloquial, except in certain nautical phrases; as, to heave the lead;\n   to heave the log.'),
(35227, 'Heave', 'v. t.', 'To force from, or into, any position; to cause to move;\n   also, to throw off; -- mostly used in certain nautical phrases; as, to\n   heave the ship ahead.'),
(35228, 'Heave', 'v. t.', 'To raise or force from the breast; to utter with effort;\n   as, to heave a sigh.'),
(35229, 'Heave', 'v. t.', 'To cause to swell or rise, as the breast or bosom.'),
(35230, 'Heave', 'v. i.', 'To be thrown up or raised; to rise upward, as a tower or\n   mound.'),
(35231, 'Heave', 'v. i.', 'To rise and fall with alternate motions, as the lungs in\n   heavy breathing, as waves in a heavy sea, as ships on the billows, as\n   the earth when broken up by frost, etc.; to swell; to dilate; to\n   expand; to distend; hence, to labor; to struggle.'),
(35232, 'Heave', 'v. i.', 'To make an effort to raise, throw, or move anything; to\n   strain to do something difficult.'),
(35233, 'Heave', 'v. i.', 'To make an effort to vomit; to retch; to vomit.'),
(35234, 'Heave', 'n.', 'An effort to raise something, as a weight, or one\'s self, or\n   to move something heavy.'),
(35235, 'Heave', 'n.', 'An upward motion; a rising; a swell or distention, as of the\n   breast in difficult breathing, of the waves, of the earth in an\n   earthquake, and the like.'),
(35236, 'Heave', 'n.', 'A horizontal dislocation in a metallic lode, taking place at\n   an intersection with another lode.'),
(35237, 'Heaven', 'n.', 'The expanse of space surrounding the earth; esp., that\n   which seems to be over the earth like a great arch or dome; the\n   firmament; the sky; the place where the sun, moon, and stars appear; --\n   often used in the plural in this sense.'),
(35238, 'Heaven', 'n.', 'The dwelling place of the Deity; the abode of bliss; the\n   place or state of the blessed after death.'),
(35239, 'Heaven', 'n.', 'The sovereign of heaven; God; also, the assembly of the\n   blessed, collectively; -- used variously in this sense, as in No. 2.'),
(35240, 'Heaven', 'n.', 'Any place of supreme happiness or great comfort; perfect\n   felicity; bliss; a sublime or exalted condition; as, a heaven of\n   delight.'),
(35241, 'Heavened', 'imp. & p. p.', 'of Heaven'),
(35242, 'Heaven', 'v. t.', 'To place in happiness or bliss, as if in heaven; to\n   beatify.'),
(35243, 'Heavenly', 'a.', 'Pertaining to, resembling, or inhabiting heaven;\n   celestial; not earthly; as, heavenly regions; heavenly music.'),
(35244, 'Heavenly', 'a.', 'Appropriate to heaven in character or happiness; perfect;\n   pure; supremely blessed; as, a heavenly race; the heavenly, throng.'),
(35245, 'Heavenly', 'adv.', 'In a manner resembling that of heaven.'),
(35246, 'Heavenly', 'adv.', 'By the influence or agency of heaven.'),
(35247, 'Heaver', 'n.', 'One who, or that which, heaves or lifts; a laborer employed\n   on docks in handling freight; as, a coal heaver.'),
(35248, 'Heaver', 'n.', 'A bar used as a lever.'),
(35249, 'Heaves', 'n.', 'A disease of horses, characterized by difficult breathing,\n   with heaving of the flank, wheezing, flatulency, and a peculiar cough;\n   broken wind.'),
(35250, 'Heavily', 'adv.', 'In a heavy manner; with great weight; as, to bear\n   heavily on a thing; to be heavily loaded.'),
(35251, 'Heavily', 'adv.', 'As if burdened with a great weight; slowly and\n   laboriously; with difficulty; hence, in a slow, difficult, or suffering\n   manner; sorrowfully.'),
(35252, 'Heaving', 'n.', 'A lifting or rising; a swell; a panting or deep sighing.'),
(35253, 'Heavy', 'a.', 'Having the heaves.'),
(35254, 'Heavy', 'superl.', 'Heaved or lifted with labor; not light; weighty;\n   ponderous; as, a heavy stone; hence, sometimes, large in extent,\n   quantity, or effects; as, a heavy fall of rain or snow; a heavy\n   failure; heavy business transactions, etc.; often implying strength;\n   as, a heavy barrier; also, difficult to move; as, a heavy draught.'),
(35255, 'Heavy', 'superl.', 'Not easy to bear; burdensome; oppressive; hard to\n   endure or accomplish; hence, grievous, afflictive; as, heavy yokes,\n   expenses, undertakings, trials, news, etc.'),
(35256, 'Heavy', 'superl.', 'Laden with that which is weighty; encumbered; burdened;\n   bowed down, either with an actual burden, or with care, grief, pain,\n   disappointment.'),
(35257, 'Heavy', 'superl.', 'Slow; sluggish; inactive; or lifeless, dull, inanimate,\n   stupid; as, a heavy gait, looks, manners, style, and the like; a heavy\n   writer or book.'),
(35258, 'Heavy', 'superl.', 'Strong; violent; forcible; as, a heavy sea, storm,\n   cannonade, and the like.'),
(35259, 'Heavy', 'superl.', 'Loud; deep; -- said of sound; as, heavy thunder.'),
(35260, 'Heavy', 'superl.', 'Dark with clouds, or ready to rain; gloomy; -- said of\n   the sky.'),
(35261, 'Heavy', 'superl.', 'Impeding motion; cloggy; clayey; -- said of earth; as,\n   a heavy road, soil, and the like.'),
(35262, 'Heavy', 'superl.', 'Not raised or made light; as, heavy bread.'),
(35263, 'Heavy', 'superl.', 'Not agreeable to, or suitable for, the stomach; not\n   easily digested; -- said of food.'),
(35264, 'Heavy', 'superl.', 'Having much body or strength; -- said of wines, or\n   other liquors.'),
(35265, 'Heavy', 'superl.', 'With child; pregnant.'),
(35266, 'Heavy', 'adv.', 'Heavily; -- sometimes used in composition; as,\n   heavy-laden.'),
(35267, 'Heavy', 'v. t.', 'To make heavy.'),
(35268, 'Hebdomad', 'n.', 'A week; a period of seven days.'),
(35269, 'Heben', 'n.', 'Ebony.'),
(35270, 'Hebenon', 'n.', 'See Henbane.'),
(35271, 'Hebetate', 'v. t.', 'To render obtuse; to dull; to blunt; to stupefy; as,\n   to hebetate the intellectual faculties.'),
(35272, 'Hebetate', 'a.', 'Obtuse; dull.'),
(35273, 'Hebetate', 'a.', 'Having a dull or blunt and soft point.'),
(35274, 'Hebete', 'a.', 'Dull; stupid.'),
(35275, 'Hebetude', 'n.', 'Dullness; stupidity.'),
(35276, 'Hebraic', 'a.', 'Of or pertaining to the Hebrews, or to the language of the\n   Hebrews.'),
(35277, 'Hebraism', 'n.', 'A Hebrew idiom or custom; a peculiar expression or manner\n   of speaking in the Hebrew language.'),
(35278, 'Hebraism', 'n.', 'The type of character of the Hebrews.'),
(35279, 'Hebraist', 'n.', 'One versed in the Hebrew language and learning.'),
(35280, 'Hebraize', 'v. t.', 'To convert into the Hebrew idiom; to make Hebrew or\n   Hebraistic.'),
(35281, 'Hebraize', 'v. i.', 'To speak Hebrew, or to conform to the Hebrew idiom, or\n   to Hebrew customs.'),
(35282, 'Hebrew', 'n.', 'An appellative of Abraham or of one of his descendants,\n   esp. in the line of Jacob; an Israelite; a Jew.'),
(35283, 'Hebrew', 'n.', 'The language of the Hebrews; -- one of the Semitic family\n   of languages.'),
(35284, 'Hebrew', 'a.', 'Of or pertaining to the Hebrews; as, the Hebrew language or\n   rites.'),
(35285, 'Hecatomb', 'n.', 'A sacrifice of a hundred oxen or cattle at the same time;\n   hence, the sacrifice or slaughter of any large number of victims.'),
(35286, 'Heckimal', 'n.', 'The European blue titmouse (Parus coeruleus).'),
(35287, 'Heckle', 'n. & v. t.', 'Same as Hackle.'),
(35288, 'Hectare', 'n.', 'A measure of area, or superficies, containing a hundred\n   ares, or 10,000 square meters, and equivalent to 2.471 acres.'),
(35289, 'Hectic', 'a.', 'Habitual; constitutional; pertaining especially to slow\n   waste of animal tissue, as in consumption; as, a hectic type in\n   disease; a hectic flush.'),
(35290, 'Hectic', 'a.', 'In a hectic condition; having hectic fever; consumptive;\n   as, a hectic patient.'),
(35291, 'Hectic', 'n.', 'Hectic fever.'),
(35292, 'Hectic', 'n.', 'A hectic flush.'),
(35293, 'Hector', 'n.', 'A bully; a blustering, turbulent, insolent, fellow; one who\n   vexes or provokes.'),
(35294, 'Hectored', 'imp. & p. p.', 'of Hector'),
(35295, 'Hector', 'v. t.', 'To treat with insolence; to threaten; to bully; hence,\n   to torment by words; to tease; to taunt; to worry or irritate by\n   bullying.'),
(35296, 'Hector', 'v. i.', 'To play the bully; to bluster; to be turbulent or\n   insolent.'),
(35297, 'Hectorly', 'a.', 'Resembling a hector; blustering; insolent; taunting.'),
(35298, 'Heddles', 'pl. ', 'of Heddle'),
(35299, 'Heddle', 'n.', 'One of the sets of parallel doubled threads which, with\n   mounting, compose the harness employed to guide the warp threads to the\n   lathe or batten in a loom.'),
(35300, 'Heddle', 'v. t.', 'To draw (the warp thread) through the heddle-eyes, in\n   weaving.'),
(35301, 'Heddling', 'vb. n.', 'The act of drawing the warp threads through the\n   heddle-eyes of a weaver\'s harness; the harness itself.'),
(35302, 'Hederal', 'a.', 'Of or pertaining to ivy.'),
(35303, 'Hederic', 'a.', 'Pertaining to, or derived from, the ivy (Hedera); as,\n   hederic acid, an acid of the acetylene series.'),
(35304, 'Hederose', 'a.', 'Pertaining to, or of, ivy; full of ivy.'),
(35305, 'Hedge', 'n.', 'A thicket of bushes, usually thorn bushes; especially, such\n   a thicket planted as a fence between any two portions of land; and also\n   any sort of shrubbery, as evergreens, planted in a line or as a fence;\n   particularly, such a thicket planted round a field to fence it, or in\n   rows to separate the parts of a garden.'),
(35306, 'Hedged', 'imp. & p. p.', 'of Hedge'),
(35307, 'Hedging', 'p. pr. & vb. n.', 'of Hedge'),
(35308, 'Hedge', 'v. t.', 'To inclose or separate with a hedge; to fence with a\n   thickly set line or thicket of shrubs or small trees; as, to hedge a\n   field or garden.'),
(35309, 'Hedge', 'v. t.', 'To obstruct, as a road, with a barrier; to hinder from\n   progress or success; -- sometimes with up and out.'),
(35310, 'Hedge', 'v. t.', 'To surround for defense; to guard; to protect; to hem\n   (in).'),
(35311, 'Hedge', 'v. t.', 'To surround so as to prevent escape.'),
(35312, 'Hedge', 'v. i.', 'To shelter one\'s self from danger, risk, duty,\n   responsibility, etc., as if by hiding in or behind a hedge; to skulk;\n   to slink; to shirk obligations.'),
(35313, 'Hedge', 'v. i.', 'To reduce the risk of a wager by making a bet against the\n   side or chance one has bet on.'),
(35314, 'Hedge', 'v. i.', 'To use reservations and qualifications in one\'s speech so\n   as to avoid committing one\'s self to anything definite.'),
(35315, 'Hedgehog', 'n.', 'A small European insectivore (Erinaceus Europaeus), and\n   other allied species of Asia and Africa, having the hair on the upper\n   part of its body mixed with prickles or spines. It is able to roll\n   itself into a ball so as to present the spines outwardly in every\n   direction. It is nocturnal in its habits, feeding chiefly upon insects.'),
(35316, 'Hedgehog', 'n.', 'The Canadian porcupine.'),
(35317, 'Hedgehog', 'n.', 'A species of Medicago (M. intertexta), the pods of which\n   are armed with short spines; -- popularly so called.'),
(35318, 'Hedgehog', 'n.', 'A form of dredging machine.'),
(35319, 'Hedgepig', 'n.', 'A young hedgehog.'),
(35320, 'Hedger', 'n.', 'One who makes or mends hedges; also, one who hedges, as, in\n   betting.'),
(35321, 'Hedgerow', 'n.', 'A row of shrubs, or trees, planted for inclosure or\n   separation of fields.'),
(35322, 'Hedonic', 'a.', 'Pertaining to pleasure.'),
(35323, 'Hedonic', 'a.', 'Of or relating to Hedonism or the Hedonic sect.'),
(35324, 'Heeded', 'imp. & p. p.', 'of Heed'),
(35325, 'Heeding', 'p. pr. & vb. n.', 'of Heed'),
(35326, 'Heedful', 'a.', 'Full of heed; regarding with care; cautious; circumspect;\n   attentive; vigilant.'),
(35327, 'Heedless', 'a.', 'Without heed or care; inattentive; careless; thoughtless;\n   unobservant.'),
(35328, 'Heedy', 'a.', 'Heedful.'),
(35329, 'Heeled', 'imp. & p. p.', 'of Heel'),
(35330, 'Heeling', 'p. pr. & vb. n.', 'of Heel'),
(35331, 'Heelball', 'n.', 'A composition of wax and lampblack, used by shoemakers\n   for polishing, and by antiquaries in copying inscriptions.'),
(35332, 'Heeler', 'n.', 'A cock that strikes well with his heels or spurs.'),
(35333, 'Heeler', 'n.', 'A dependent and subservient hanger-on of a political\n   patron.'),
(35334, 'Heelless', 'a.', 'Without a heel.'),
(35335, 'Heelpost', 'n.', 'The post supporting the outer end of a propeller shaft.'),
(35336, 'Heelpost', 'n.', 'The post to which a gate or door is hinged.'),
(35337, 'Heelpost', 'n.', 'The quoin post of a lock gate.'),
(35338, 'Heelspur', 'n.', 'A slender bony or cartilaginous process developed from\n   the heel bone of bats. It helps to support the wing membranes. See\n   Illust. of Cheiropter.'),
(35339, 'Heeltap', 'n.', 'One of the segments of leather in the heel of a shoe.'),
(35340, 'Heeltap', 'n.', 'A small portion of liquor left in a glass after drinking.'),
(35341, 'Heeltap', 'v. t.', 'To add a piece of leather to the heel of (a shoe, boot,\n   etc.)'),
(35342, 'Heeltool', 'n.', 'A tool used by turners in metal, having a bend forming a\n   heel near the cutting end.'),
(35343, 'Hefted', 'imp. & p. p.', 'of Heft'),
(35344, 'Hefting', 'p. pr. & vb. n.', 'of Heft'),
(35345, 'Hefty', 'a.', 'Moderately heavy.'),
(35346, 'Hegelian', 'a.', 'Pertaining to Hegelianism.'),
(35347, 'Hegelian', 'n.', 'A follower of Hegel.'),
(35348, 'Hegelism', 'n.', 'The system of logic and philosophy set forth by Hegel, a\n   German writer (1770-1831).'),
(35349, 'Hegemony', 'n.', 'Leadership; preponderant influence or authority; --\n   usually applied to the relation of a government or state to its\n   neighbors or confederates.'),
(35350, 'Hegge', 'n.', 'A hedge.'),
(35351, 'Hegira', 'n.', 'The flight of Mohammed from Mecca, September 13, A. D. 622\n   (subsequently established as the first year of the Moslem era); hence,\n   any flight or exodus regarded as like that of Mohammed.'),
(35352, 'Heifer', 'n.', 'A young cow.'),
(35353, 'Heigh-ho', 'interj.', 'An exclamation of surprise, joy, dejection,\n   uneasiness, weariness, etc.'),
(35354, 'Height', 'n.', 'The condition of being high; elevated position.'),
(35355, 'Height', 'n.', 'The distance to which anything rises above its foot, above\n   that on which in stands, above the earth, or above the level of the\n   sea; altitude; the measure upward from a surface, as the floor or the\n   ground, of animal, especially of a man; stature.'),
(35356, 'Height', 'n.', 'Degree of latitude either north or south.'),
(35357, 'Height', 'n.', 'That which is elevated; an eminence; a hill or mountain;\n   as, Alpine heights.'),
(35358, 'Height', 'n.', 'Elevation in excellence of any kind, as in power, learning,\n   arts; also, an advanced degree of social rank; preeminence or\n   distinction in society; prominence.'),
(35359, 'Height', 'n.', 'Progress toward eminence; grade; degree.'),
(35360, 'Height', 'n.', 'Utmost degree in extent; extreme limit of energy or\n   condition; as, the height of a fever, of passion, of madness, of folly;\n   the height of a tempest.'),
(35361, 'Heighten', 'v. t.', 'To make high; to raise higher; to elevate.'),
(35362, 'Heighten', 'v. t.', 'To carry forward; to advance; to increase; to augment;\n   to aggravate; to intensify; to render more conspicuous; -- used of\n   things, good or bad; as, to heighten beauty; to heighten a flavor or a\n   tint.'),
(35363, 'Heinous', 'a.', 'Hateful; hatefully bad; flagrant; odious; atrocious;\n   giving great great offense; -- applied to deeds or to character.'),
(35364, 'Heirdom', 'n.', 'The state of an heir; succession by inheritance.'),
(35365, 'Heiress', 'n.', 'A female heir.'),
(35366, 'Heirless', 'a.', 'Destitute of an heir.'),
(35367, 'Heirloom', 'n.', 'Any furniture, movable, or personal chattel, which by law\n   or special custom descends to the heir along with the inheritance; any\n   piece of personal property that has been in a family for several\n   generations.'),
(35368, 'Heirship', 'n.', 'The state, character, or privileges of an heir; right of\n   inheriting.'),
(35369, 'Hejira', 'n.', 'See Hegira.'),
(35370, 'Hektare', 'n.', 'Alt. of Hektometer'),
(35371, 'Helamys', 'n.', 'See Jumping hare, under Hare.'),
(35372, 'Helena', 'n.', 'See St. Elmo\'s fire, under Saint.'),
(35373, 'Helenin', 'n.', 'A neutral organic substance found in the root of the\n   elecampane (Inula helenium), and extracted as a white crystalline or\n   oily material, with a slightly bitter taste.'),
(35374, 'Heliac', 'a.', 'Heliacal.'),
(35375, 'Heliacal', 'a.', 'Emerging from the light of the sun, or passing into it;\n   rising or setting at the same, or nearly the same, time as the sun.'),
(35376, 'Helical', 'a.', 'Of or pertaining to, or in the form of, a helix; spiral;\n   as, a helical staircase; a helical spring.'),
(35377, 'Helicin', 'n.', 'A glucoside obtained as a white crystalline substance by\n   partial oxidation of salicin, from a willow (Salix Helix of Linnaeus.)'),
(35378, 'Helicine', 'a.', 'Curled; spiral; helicoid; -- applied esp. to certain\n   arteries of the penis.'),
(35379, 'Helicoid', 'a.', 'Spiral; curved, like the spire of a univalve shell.'),
(35380, 'Helicoid', 'a.', 'Shaped like a snail shell; pertaining to the Helicidae,\n   or Snail family.'),
(35381, 'Helicoid', 'n.', 'A warped surface which may be generated by a straight\n   line moving in such a manner that every point of the line shall have a\n   uniform motion in the direction of another fixed straight line, and at\n   the same time a uniform angular motion about it.'),
(35382, 'Helicon', 'n.', 'A mountain in Boeotia, in Greece, supposed by the Greeks\n   to be the residence of Apollo and the Muses.'),
(35383, 'Helio-', '', 'A combining form from Gr. \"h`lios the sun.'),
(35384, 'Heliozoa', 'n. pl.', 'An order of fresh-water rhizopods having a more or\n   less globular form, with slender radiating pseudopodia; the sun\n   animalcule.'),
(35385, 'Helium', 'n.', 'A gaseous element found in the atmospheres of the sun and\n   earth and in some rare minerals.'),
(35386, 'Helices', 'pl. ', 'of Helix'),
(35387, 'Helixes', 'pl. ', 'of Helix'),
(35388, 'Helix', 'n.', 'A nonplane curve whose tangents are all equally inclined to\n   a given plane. The common helix is the curve formed by the thread of\n   the ordinary screw. It is distinguished from the spiral, all the\n   convolutions of which are in the plane.'),
(35389, 'Helix', 'n.', 'A caulicule or little volute under the abacus of the\n   Corinthian capital.'),
(35390, 'Helix', 'n.', 'The incurved margin or rim of the external ear. See Illust.\n   of Ear.'),
(35391, 'Helix', 'n.', 'A genus of land snails, including a large number of species.'),
(35392, 'Hellborn', 'a.', 'Born in or of hell.'),
(35393, 'Hellbred', 'a.', 'Produced in hell.'),
(35394, 'Hell-cat', 'n.', 'A witch; a hag.'),
(35395, 'Hellene', 'n.', 'A native of either ancient or modern Greece; a Greek.'),
(35396, 'Hellenic', 'a.', 'Of or pertaining to the Hellenes, or inhabitants of\n   Greece; Greek; Grecian.'),
(35397, 'Hellenic', 'n.', 'The dialect, formed with slight variations from the\n   Attic, which prevailed among Greek writers after the time of Alexander.'),
(35398, 'Hellhag', 'n.', 'A hag of or fit for hell.'),
(35399, 'Hellier', 'v. t.', 'One who heles or covers; hence, a tiler, slater, or\n   thatcher.'),
(35400, 'Hellish', 'a.', 'Of or pertaining to hell; like hell; infernal; malignant;\n   wicked; detestable; diabolical.'),
(35401, 'Hellkite', 'n.', 'A kite of infernal breed.'),
(35402, 'Hello', 'interj. & n.', 'See Halloo.'),
(35403, 'Hellward', 'adv.', 'Toward hell.'),
(35404, 'Helly', 'a.', 'Hellish.'),
(35405, 'Helmed', 'imp. & p. p.', 'of Helm'),
(35406, 'Helming', 'p. pr. & vb. n.', 'of Helm'),
(35407, 'Helmage', 'n.', 'Guidance; direction.'),
(35408, 'Helmed', 'a.', 'Covered with a helmet.'),
(35409, 'Helmet', 'n.', 'A defensive covering for the head. See Casque, Headpiece,\n   Morion, Sallet, and Illust. of Beaver.'),
(35410, 'Helmet', 'n.', 'The representation of a helmet over shields or coats of\n   arms, denoting gradations of rank by modifications of form.'),
(35411, 'Helmet', 'n.', 'A helmet-shaped hat, made of cork, felt, metal, or other\n   suitable material, worn as part of the uniform of soldiers, firemen,\n   etc., also worn in hot countries as a protection from the heat of the\n   sun.'),
(35412, 'Helmet', 'n.', 'That which resembles a helmet in form, position, etc.'),
(35413, 'Helmet', 'n.', 'The upper part of a retort.'),
(35414, 'Helmet', 'n.', 'The hood-formed upper sepal or petal of some flowers, as of\n   the monkshood or the snapdragon.'),
(35415, 'Helmet', 'n.', 'A naked shield or protuberance on the top or fore part of\n   the head of a bird.'),
(35416, 'Helmeted', 'a.', 'Wearing a helmet; furnished with or having a helmet or\n   helmet-shaped part; galeate.'),
(35417, 'Helminth', 'n.', 'An intestinal worm, or wormlike intestinal parasite; one\n   of the Helminthes.'),
(35418, 'Helmless', 'a.', 'Destitute of a helmet.'),
(35419, 'Helmless', 'a.', 'Without a helm or rudder.'),
(35420, 'Helmsmen', 'pl. ', 'of Helmsman'),
(35421, 'Helmsman', 'n.', 'The man at the helm; a steersman.'),
(35422, 'Helmwind', 'n.', 'A wind attending or presaged by the cloud called helm.'),
(35423, 'Helot', 'n.', 'A slave in ancient Sparta; a Spartan serf; hence, a slave or\n   serf.'),
(35424, 'Helotism', 'n.', 'The condition of the Helots or slaves in Sparta; slavery.'),
(35425, 'Helotry', 'n.', 'The Helots, collectively; slaves; bondsmen.'),
(35426, 'Helped', 'imp. & p. p.', 'of Help'),
(35427, 'Holpen', 'p. p.', 'of Help'),
(35428, 'Helping', 'p. pr. & vb. n.', 'of Help'),
(35429, 'Helper', 'n.', 'One who, or that which, helps, aids, assists, or relieves;\n   as, a lay helper in a parish.'),
(35430, 'Helpful', 'a.', 'Furnishing help; giving aid; assistant; useful; salutary.'),
(35431, 'Helpless', 'a.', 'Destitute of help or strength; unable to help or defend\n   one\'s self; needing help; feeble; weak; as, a helpless infant.'),
(35432, 'Helpless', 'a.', 'Beyond help; irremediable.'),
(35433, 'Helpless', 'a.', 'Bringing no help; unaiding.'),
(35434, 'Helpless', 'a.', 'Unsupplied; destitute; -- with of.'),
(35435, 'Helpmate', 'n.', 'A helper; a companion; specifically, a wife.'),
(35436, 'Helpmeet', 'n.', 'A wife; a helpmate.'),
(35437, 'Helve', 'n.', 'The handle of an ax, hatchet, or adze.'),
(35438, 'Helve', 'n.', 'The lever at the end of which is the hammer head, in a forge\n   hammer.'),
(35439, 'Helve', 'n.', 'A forge hammer which is lifted by a cam acting on the helve\n   between the fulcrum and the head.'),
(35440, 'Helved', 'imp. & p. p.', 'of Helve'),
(35441, 'Helving', 'p. pr. & vb. n.', 'of Helve'),
(35442, 'Helve', 'v. t.', 'To furnish with a helve, as an ax.'),
(35443, 'Helvetic', 'a.', 'Of or pertaining to the Helvetii, the ancient inhabitant\n   of the Alps, now Switzerland, or to the modern states and inhabitant of\n   the Alpine regions; as, the Helvetic confederacy; Helvetic states.'),
(35444, 'Helvine', 'n.', 'Alt. of Helvite'),
(35445, 'Helvite', 'n.', 'A mineral of a yellowish color, consisting chiefly of\n   silica, glucina, manganese, and iron, with a little sulphur.'),
(35446, 'Hemmed', 'imp. & p. p.', 'of Hem'),
(35447, 'Hemming', 'p. pr. & vb. n.', 'of Hem'),
(35448, 'Hema-', '', 'Same as Haema-.'),
(35449, 'Hemacite', 'n.', 'A composition made from blood, mixed with mineral or\n   vegetable substances, used for making buttons, door knobs, etc.'),
(35450, 'Hemal', 'a.', 'Relating to the blood or blood vessels; pertaining to,\n   situated in the region of, or on the side with, the heart and great\n   blood vessels; -- opposed to neural.'),
(35451, 'Hematein', 'n.', 'A reddish brown or violet crystalline substance,\n   C16H12O6, got from hematoxylin by partial oxidation, and regarded as\n   analogous to the phthaleins.'),
(35452, 'Hematic', 'a.', 'Same as Haematic.'),
(35453, 'Hematic', 'n.', 'A medicine designed to improve the condition of the blood.'),
(35454, 'Hematin', 'n.', 'Hematoxylin.'),
(35455, 'Hematin', 'n.', 'A bluish black, amorphous substance containing iron and\n   obtained from blood. It exists the red blood corpuscles united with\n   globulin, and the form of hemoglobin or oxyhemoglobin gives to the\n   blood its red color.'),
(35456, 'Hematite', 'n.', 'An important ore of iron, the sesquioxide, so called\n   because of the red color of the powder. It occurs in splendent\n   rhombohedral crystals, and in massive and earthy forms; -- the last\n   called red ocher. Called also specular iron, oligist iron, rhombohedral\n   iron ore, and bloodstone. See Brown hematite, under Brown.'),
(35457, 'Hemato', '', 'See Haema-.'),
(35458, 'Hematoid', 'a.', 'Resembling blood.'),
(35459, 'Hematoma', 'n.', 'A circumscribed swelling produced by an effusion of blood\n   beneath the skin.'),
(35460, 'Hemi-', '', 'A prefix signifying half.'),
(35461, 'Hemicarp', 'n.', 'One portion of a fruit that spontaneously divides into\n   halves.'),
(35462, 'Hemin', 'n.', 'A substance, in the form of reddish brown, microscopic,\n   prismatic crystals, formed from dried blood by the action of strong\n   acetic acid and common salt; -- called also Teichmann\'s crystals.\n   Chemically, it is a hydrochloride of hematin.'),
(35463, 'Heminae', 'pl. ', 'of Hemina'),
(35464, 'Hemina', 'n.', 'A measure of half a sextary.'),
(35465, 'Hemina', 'n.', 'A measure equal to about ten fluid ounces.'),
(35466, 'Hemionus', 'n.', 'A wild ass found in Thibet; the kiang.'),
(35467, 'Hemiopia', 'n.', 'Alt. of Hemiopsia'),
(35468, 'Hemipode', 'n.', 'Any bird of the genus Turnix. Various species inhabit\n   Asia, Africa, and Australia.'),
(35469, 'Hemipter', 'n.', 'One of the Hemiptera.'),
(35470, 'Hemisect', 'v. t.', 'To divide along the mesial plane.'),
(35471, 'Hemitone', 'n.', 'See Semitone.'),
(35472, 'Hemlock', 'n.', 'The name of several poisonous umbelliferous herbs having\n   finely cut leaves and small white flowers, as the Cicuta maculata,\n   bulbifera, and virosa, and the Conium maculatum. See Conium.'),
(35473, 'Hemlock', 'n.', 'An evergreen tree common in North America (Abies, / Tsuga,\n   Canadensis); hemlock spruce.'),
(35474, 'Hemlock', 'n.', 'The wood or timber of the hemlock tree.'),
(35475, 'Hemmel', 'n.', 'A shed or hovel for cattle.'),
(35476, 'Hemmer', 'n.', 'One who, or that which, hems with a needle.'),
(35477, 'Hemmer', 'n.', 'An attachment to a sewing machine, for turning under the\n   edge of a piece of fabric, preparatory to stitching it down.'),
(35478, 'Hemmer', 'n.', 'A tool for turning over the edge of sheet metal to make a\n   hem.'),
(35479, 'Hemo-', '', 'Same as Haema-, Haemo-.'),
(35480, 'Hempen', 'a.', 'Made of hemp; as, a hempen cord.'),
(35481, 'Hempen', 'a.', 'Like hemp.'),
(35482, 'Hempy', 'a.', 'Like hemp.'),
(35483, 'Hemself', 'pron.', 'Alt. of Hemselven'),
(35484, 'Hemuse', 'n.', 'The roebuck in its third year.'),
(35485, 'Henbane', 'n.', 'A plant of the genus Hyoscyamus (H. niger). All parts of\n   the plant are poisonous, and the leaves are used for the same purposes\n   as belladonna. It is poisonous to domestic fowls; whence the name.\n   Called also, stinking nightshade, from the fetid odor of the plant. See\n   Hyoscyamus.'),
(35486, 'Henbit', 'n.', 'A weed of the genus Lamium (L. amplexicaule) with deeply\n   crenate leaves.'),
(35487, 'Hence', 'adv.', 'From this place; away.'),
(35488, 'Hence', 'adv.', 'From this time; in the future; as, a week hence.'),
(35489, 'Hence', 'adv.', 'From this reason; as an inference or deduction.'),
(35490, 'Hence', 'adv.', 'From this source or origin.'),
(35491, 'Hence', 'v. t.', 'To send away.'),
(35492, 'Henchboy', 'n.', 'A page; a servant.'),
(35493, 'Henchman', 'n.', 'An attendant; a servant; a follower. Now chiefly used as\n   a political cant term.'),
(35494, 'Hencoop', 'n.', 'A coop or cage for hens.'),
(35495, 'Hende', 'a.', 'Skillful; dexterous; clever.'),
(35496, 'Hende', 'a.', 'Friendly; civil; gentle; kind.'),
(35497, 'Hendy', 'a.', 'See Hende.'),
(35498, 'Henen', 'adv.', 'Hence.'),
(35499, 'Henfish', 'n.', 'A marine fish; the sea bream.'),
(35500, 'Henfish', 'n.', 'A young bib. See Bib, n., 2.'),
(35501, 'Henhouse', 'n.', 'A house or shelter for fowls.'),
(35502, 'Henhussy', 'n.', 'A cotquean; a man who intermeddles with women\'s concerns.'),
(35503, 'Heniquen', 'n.', 'See Jeniquen.'),
(35504, 'Henna', 'n.', 'A thorny tree or shrub of the genus Lawsonia (L. alba). The\n   fragrant white blossoms are used by the Buddhists in religious\n   ceremonies. The powdered leaves furnish a red coloring matter used in\n   the East to stain the hails and fingers, the manes of horses, etc.'),
(35505, 'Henna', 'n.', 'The leaves of the henna plant, or a preparation or dyestuff\n   made from them.'),
(35506, 'Hennery', 'n.', 'An inclosed place for keeping hens.'),
(35507, 'Hennes', 'adv.', 'Hence.'),
(35508, 'Henotic', 'a.', 'Harmonizing; irenic.'),
(35509, 'Henpeck', 'v. t.', 'To subject to petty authority; -- said of a wife who\n   thus treats her husband. Commonly used in the past participle (often\n   adjectively).'),
(35510, 'Henroost', 'n.', 'A place where hens roost.'),
(35511, 'Henrys', 'pl. ', 'of Henry'),
(35512, 'Henry', 'n.', 'The unit of electric induction; the induction in a circuit\n   when the electro-motive force induced in this circuit is one volt,\n   while the inducing current varies at the rate of one ampere a second.'),
(35513, 'Hente', 'imp.', 'of Hent'),
(35514, 'Henware', 'n.', 'A coarse, blackish seaweed. See Badderlocks.'),
(35515, 'Henxman', 'n.', 'Henchman.'),
(35516, 'Hepar', 'n.', 'Liver of sulphur; a substance of a liver-brown color,\n   sometimes used in medicine. It is formed by fusing sulphur with\n   carbonates of the alkalies (esp. potassium), and consists essentially\n   of alkaline sulphides. Called also hepar sulphuris (/).'),
(35517, 'Hepar', 'n.', 'Any substance resembling hepar proper, in appearance;\n   specifically, in homeopathy, calcium sulphide, called also hepar\n   sulphuris calcareum (/).'),
(35518, 'Hepatic', 'a.', 'Of or pertaining to the liver; as, hepatic artery; hepatic\n   diseases.'),
(35519, 'Hepatic', 'a.', 'Resembling the liver in color or in form; as, hepatic\n   cinnabar.'),
(35520, 'Hepatic', 'a.', 'Pertaining to, or resembling, the plants called Hepaticae,\n   or scale mosses and liverworts.'),
(35521, 'Hepatica', 'n.', 'A genus of pretty spring flowers closely related to\n   Anemone; squirrel cup.'),
(35522, 'Hepatica', 'n.', 'Any plant, usually procumbent and mosslike, of the\n   cryptogamous class Hepaticae; -- called also scale moss and liverwort.\n   See Hepaticae, in the Supplement.'),
(35523, 'Hepatite', 'n.', 'A variety of barite emitting a fetid odor when rubbed or\n   heated.'),
(35524, 'Hepatize', 'v. t.', 'To impregnate with sulphureted hydrogen gas, formerly\n   called hepatic gas.'),
(35525, 'Hepatize', 'v. t.', 'To gorge with effused matter, as the lungs.'),
(35526, 'Heppen', 'a.', 'Neat; fit; comfortable.'),
(35527, 'Hepper', 'n.', 'A young salmon; a parr.'),
(35528, 'Hepta', '', 'A combining form from Gr. \"epta`, seven.'),
(35529, 'Heptad', 'n.', 'An atom which has a valence of seven, and which can be\n   theoretically combined with, substituted for, or replaced by, seven\n   monad atoms or radicals; as, iodine is a heptad in iodic acid. Also\n   used as an adjective.'),
(35530, 'Heptade', 'n.', 'The sum or number of seven.'),
(35531, 'Heptagon', 'n.', 'A plane figure consisting of seven sides and having seven\n   angles.'),
(35532, 'Heptane', 'n.', 'Any one of several isometric hydrocarbons, C7H16, of the\n   paraffin series (nine are possible, four are known); -- so called\n   because the molecule has seven carbon atoms. Specifically, a colorless\n   liquid, found as a constituent of petroleum, in the tar oil of cannel\n   coal, etc.'),
(35533, 'Heptarch', 'n.', 'Same as Heptarchist.'),
(35534, 'Heptene', 'n.', 'Same as Heptylene.'),
(35535, 'Heptine', 'n.', 'Any one of a series of unsaturated metameric hydrocarbons,\n   C7H12, of the acetylene series.'),
(35536, 'Heptoic', 'a.', 'Pertaining to, or derived from, heptane; as, heptoic acid.'),
(35537, 'Heptone', 'n.', 'A liquid hydrocarbon, C7H10, of the valylene series.'),
(35538, 'Hep tree', '', 'The wild dog-rose.'),
(35539, 'Heptyl', 'n.', 'A compound radical, C7H15, regarded as the essential\n   radical of heptane and a related series of compounds.'),
(35540, 'Heptylic', 'a.', 'Pertaining to, or derived from, heptyl or heptane; as,\n   heptylic alcohol. Cf. /nanthylic.'),
(35541, 'Herald', 'n.', 'An officer whose business was to denounce or proclaim war,\n   to challenge to battle, to proclaim peace, and to bear messages from\n   the commander of an army. He was invested with a sacred and inviolable\n   character.'),
(35542, 'Herald', 'n.', 'In the Middle Ages, the officer charged with the above\n   duties, and also with the care of genealogies, of the rights and\n   privileges of noble families, and especially of armorial bearings. In\n   modern times, some vestiges of this office remain, especially in\n   England. See Heralds\' College (below), and King-at-Arms.'),
(35543, 'Herald', 'n.', 'A proclaimer; one who, or that which, publishes or\n   announces; as, the herald of another\'s fame.'),
(35544, 'Herald', 'n.', 'A forerunner; a a precursor; a harbinger.'),
(35545, 'Herald', 'n.', 'Any messenger.'),
(35546, 'Heralded', 'imp. & p. p.', 'of Herald'),
(35547, 'Herald', 'v. t.', 'To introduce, or give tidings of, as by a herald; to\n   proclaim; to announce; to foretell; to usher in.'),
(35548, 'Heraldic', 'a.', 'Of or pertaining to heralds or heraldry; as, heraldic\n   blazoning; heraldic language.'),
(35549, 'Heraldry', 'n.', 'The art or office of a herald; the art, practice, or\n   science of recording genealogies, and blazoning arms or ensigns\n   armorial; also, of marshaling cavalcades, processions, and public\n   ceremonies.'),
(35550, 'Heraud', 'n.', 'A herald.'),
(35551, 'Herbage', 'n.', 'Herbs collectively; green food beasts; grass; pasture.'),
(35552, 'Herbage', 'n.', 'The liberty or right of pasture in the forest or in the\n   grounds of another man.'),
(35553, 'Herbaged', 'a.', 'Covered with grass.'),
(35554, 'Herbal', 'a.', 'Of or pertaining to herbs.'),
(35555, 'Herbal', 'n.', 'A book containing the names and descriptions of plants.'),
(35556, 'Herbal', 'n.', 'A collection of specimens of plants, dried and preserved; a\n   hortus siccus; an herbarium.'),
(35557, 'Herbar', 'n.', 'An herb.'),
(35558, 'Herbaria', 'pl. ', 'of Herbarium'),
(35559, 'Herbary', 'n.', 'A garden of herbs; a cottage garden.'),
(35560, 'Herber', 'n.', 'A garden; a pleasure garden.'),
(35561, 'Herbergh', 'n.', 'Alt. of Herberwe'),
(35562, 'Herberwe', 'n.', 'A harbor.'),
(35563, 'Herbid', 'a.', 'Covered with herbs.'),
(35564, 'Herbist', 'n.', 'A herbalist.'),
(35565, 'Herbless', 'a.', 'Destitute of herbs or of vegetation.'),
(35566, 'Herblet', 'n.', 'A small herb.'),
(35567, 'Herbose', 'a.', 'Alt. of Herbous'),
(35568, 'Herbous', 'a.', 'Abounding with herbs.'),
(35569, 'Herby', 'a.', 'Having the nature of, pertaining to, or covered with, herbs\n   or herbage.'),
(35570, 'Hercules', 'n.', 'A hero, fabled to have been the son of Jupiter and\n   Alcmena, and celebrated for great strength, esp. for the accomplishment\n   of his twelve great tasks or \"labors.\"'),
(35571, 'Hercules', 'n.', 'A constellation in the northern hemisphere, near Lyra.'),
(35572, 'Herded', 'imp. & p. p.', 'of Herd'),
(35573, 'Herding', 'p. pr. & vb. n.', 'of Herd'),
(35574, 'Herdbook', 'n.', 'A book containing the list and pedigrees of one or more\n   herds of choice breeds of cattle; -- also called herd record, or herd\n   register.'),
(35575, 'Herder', 'n.', 'A herdsman.'),
(35576, 'Herdess', 'n.', 'A shepherdess; a female herder.'),
(35577, 'Herdic', 'n.', 'A kind of low-hung cab.'),
(35578, 'Herdman', 'n.', 'Alt. of Herdsman'),
(35579, 'Herdsman', 'n.', 'The owner or keeper of a herd or of herds; one employed\n   in tending a herd of cattle.'),
(35580, 'women', 'pl. ', 'of Herdswoman'),
(35581, 'Here-at', 'adv.', 'At, or by reason of, this; as, he was offended hereat.'),
(35582, 'Hereby', 'adv.', 'By means of this.'),
(35583, 'Hereby', 'adv.', 'Close by; very near.'),
(35584, 'Heredity', 'n.', 'Hereditary transmission of the physical and psychical\n   qualities of parents to their offspring; the biological law by which\n   living beings tend to repeat their characteristics in their\n   descendants. See Pangenesis.'),
(35585, 'Hereford', 'n.', 'One of a breed of cattle originating in Herefordshire,\n   England. The Herefords are good working animals, and their\n   beef-producing quality is excellent.'),
(35586, 'Herein', 'adv.', 'In this.'),
(35587, 'Hereinto', 'adv.', 'Into this.'),
(35588, 'Heremit', 'n.', 'Alt. of Heremite'),
(35589, 'Heremite', 'n.', 'A hermit.'),
(35590, 'Heren', 'a.', 'Made of hair.'),
(35591, 'Hereof', 'adv.', 'Of this; concerning this; from this; hence.'),
(35592, 'Hereon', 'adv.', 'On or upon this; hereupon.'),
(35593, 'Hereout', 'adv.', 'Out of this.'),
(35594, 'Heresies', 'pl. ', 'of Heresy'),
(35595, 'Heresy', 'n.', 'An opinion held in opposition to the established or\n   commonly received doctrine, and tending to promote a division or party,\n   as in politics, literature, philosophy, etc.; -- usually, but not\n   necessarily, said in reproach.'),
(35596, 'Heresy', 'n.', 'Religious opinion opposed to the authorized doctrinal\n   standards of any particular church, especially when tending to promote\n   schism or separation; lack of orthodox or sound belief; rejection of,\n   or erroneous belief in regard to, some fundamental religious doctrine\n   or truth; heterodoxy.'),
(35597, 'Heresy', 'n.', 'An offense against Christianity, consisting in a denial of\n   some essential doctrine, which denial is publicly avowed, and\n   obstinately maintained.'),
(35598, 'Heretic', 'n.', 'One who holds to a heresy; one who believes some doctrine\n   contrary to the established faith or prevailing religion.'),
(35599, 'Heretic', 'n.', 'One who having made a profession of Christian belief,\n   deliberately and pertinaciously refuses to believe one or more of the\n   articles of faith \"determined by the authority of the universal\n   church.\"'),
(35600, 'Hereto', 'adv.', 'To this; hereunto.'),
(35601, 'Heretoch', 'n.', 'Alt. of Heretog'),
(35602, 'Heretog', 'n.', 'The leader or commander of an army; also, a marshal.'),
(35603, 'Hereunto', 'adv.', 'Unto this; up to this time; hereto.'),
(35604, 'Hereupon', 'adv.', 'On this; hereon.'),
(35605, 'Herewith', 'adv.', 'With this.'),
(35606, 'Herie', 'v. t.', 'To praise; to worship.'),
(35607, 'Heriot', 'n.', 'Formerly, a payment or tribute of arms or military\n   accouterments, or the best beast, or chattel, due to the lord on the\n   death of a tenant; in modern use, a customary tribute of goods or\n   chattels to the lord of the fee, paid on the decease of a tenant.'),
(35608, 'Herisson', 'n.', 'A beam or bar armed with iron spikes, and turning on a\n   pivot; -- used to block up a passage.'),
(35609, 'Heritage', 'a.', 'That which is inherited, or passes from heir to heir;\n   inheritance.'),
(35610, 'Heritage', 'a.', 'A possession; the Israelites, as God\'s chosen people;\n   also, a flock under pastoral charge.'),
(35611, 'Heritor', 'n.', 'A proprietor or landholder in a parish.'),
(35612, 'Herling', 'n.', 'Alt. of Hirling'),
(35613, 'Hirling', 'n.', 'The young of the sea trout.'),
(35614, 'Hermae', 'pl. ', 'of Herma'),
(35615, 'Herma', 'n.', 'See Hermes, 2.'),
(35616, 'Hermes', 'n.', 'See Mercury.'),
(35617, 'Hermes', 'n.', 'Originally, a boundary stone dedicated to Hermes as the god\n   of boundaries, and therefore bearing in some cases a head, or head and\n   shoulders, placed upon a quadrangular pillar whose height is that of\n   the body belonging to the head, sometimes having feet or other parts of\n   the body sculptured upon it. These figures, though often representing\n   Hermes, were used for other divinities, and even, in later times, for\n   portraits of human beings. Called also herma. See Terminal statue,\n   under Terminal.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(35618, 'Hermetic', 'a.', 'Alt. of Hermetical'),
(35619, 'Hermit', 'n.', 'A person who retires from society and lives in solitude; a\n   recluse; an anchoret; especially, one who so lives from religious\n   motives.'),
(35620, 'Hermit', 'n.', 'A beadsman; one bound to pray for another.'),
(35621, 'Hernani', 'n.', 'A thin silk or woolen goods, for women\'s dresses, woven in\n   various styles and colors.'),
(35622, 'Herne', 'n.', 'A corner.'),
(35623, 'Hernias', 'pl. ', 'of Hernia'),
(35624, 'Herniae', 'pl. ', 'of Hernia'),
(35625, 'Hernia', 'n.', 'A protrusion, consisting of an organ or part which has\n   escaped from its natural cavity, and projects through some natural or\n   accidental opening in the walls of the latter; as, hernia of the brain,\n   of the lung, or of the bowels. Hernia of the abdominal viscera in most\n   common. Called also rupture.'),
(35626, 'Hernial', 'a.', 'Of, or connected with, hernia.'),
(35627, 'Hernshaw', 'n.', 'Heronshaw.'),
(35628, 'Heroes', 'pl. ', 'of Hero'),
(35629, 'Herodian', 'n.', 'One of a party among the Jews, composed of partisans of\n   Herod of Galilee. They joined with the Pharisees against Christ.'),
(35630, 'Heroess', 'n.', 'A heroine.'),
(35631, 'Heroic', 'a.', 'Of or pertaining to, or like, a hero; of the nature of\n   heroes; distinguished by the existence of heroes; as, the heroic age;\n   an heroic people; heroic valor.'),
(35632, 'Heroic', 'a.', 'Worthy of a hero; bold; daring; brave; illustrious; as,\n   heroic action; heroic enterprises.'),
(35633, 'Heroic', 'a.', 'Larger than life size, but smaller than colossal; -- said\n   of the representation of a human figure.'),
(35634, 'Heroical', 'a.', 'Heroic.'),
(35635, 'Heroine', 'n.', 'A woman of an heroic spirit.'),
(35636, 'Heroine', 'n.', 'The principal female person who figures in a remarkable\n   action, or as the subject of a poem or story.'),
(35637, 'Heroism', 'n.', 'The qualities characteristic of a hero, as courage,\n   bravery, fortitude, unselfishness, etc.; the display of such qualities.'),
(35638, 'Heron', 'n.', 'Any wading bird of the genus Ardea and allied genera, of the\n   family Ardeidae. The herons have a long, sharp bill, and long legs and\n   toes, with the claw of the middle toe toothed. The common European\n   heron (Ardea cinerea) is remarkable for its directly ascending flight,\n   and was formerly hunted with the larger falcons.'),
(35639, 'Heroner', 'n.', 'A hawk used in hunting the heron.'),
(35640, 'Heronry', 'n.', 'A place where herons breed.'),
(35641, 'Heronsew', 'n.', 'A heronshaw.'),
(35642, 'Heroship', 'n.', 'The character or personality of a hero.'),
(35643, 'Herpes', 'n.', 'An eruption of the skin, taking various names, according to\n   its form, or the part affected; especially, an eruption of vesicles in\n   small distinct clusters, accompanied with itching or tingling,\n   including shingles, ringworm, and the like; -- so called from its\n   tendency to creep or spread from one part of the skin to another.'),
(35644, 'Herpetic', 'a.', 'Pertaining to, or resembling, the herpes; partaking of\n   the nature of herpes; as, herpetic eruptions.'),
(35645, 'Herring', 'n.', 'One of various species of fishes of the genus Clupea, and\n   allied genera, esp. the common round or English herring (C. harengus)\n   of the North Atlantic. Herrings move in vast schools, coming in spring\n   to the shores of Europe and America, where they are salted and smoked\n   in great quantities.'),
(35646, 'Hersal', 'n.', 'Rehearsal.'),
(35647, 'Herschel', 'n.', 'See Uranus.'),
(35648, 'Herse', 'n.', 'A kind of gate or portcullis, having iron bars, like a\n   harrow, studded with iron spikes. It is hung above gateways so that it\n   may be quickly lowered, to impede the advance of an enemy.'),
(35649, 'Herse', 'n.', 'See Hearse, a carriage for the dead.'),
(35650, 'Herse', 'n.', 'A funeral ceremonial.'),
(35651, 'Herse', 'v. t.', 'Same as Hearse, v. t.'),
(35652, 'Herself', 'pron.', 'An emphasized form of the third person feminine\n   pronoun; -- used as a subject with she; as, she herself will bear the\n   blame; also used alone in the predicate, either in the nominative or\n   objective case; as, it is herself; she blames herself.'),
(35653, 'Herself', 'pron.', 'Her own proper, true, or real character; hence, her\n   right, or sane, mind; as, the woman was deranged, but she is now\n   herself again; she has come to herself.'),
(35654, 'Herte', 'n.', 'A heart.'),
(35655, 'Hertely', 'a. & adv.', 'Hearty; heartily.'),
(35656, 'Hesitant', 'a.', 'Not prompt in deciding or acting; hesitating.'),
(35657, 'Hesitant', 'a.', 'Unready in speech.'),
(35658, 'Hesitate', 'v. i.', 'To stop or pause respecting decision or action; to be\n   in suspense or uncertainty as to a determination; as, he hesitated\n   whether to accept the offer or not; men often hesitate in forming a\n   judgment.'),
(35659, 'Hesitate', 'v. i.', 'To stammer; to falter in speaking.'),
(35660, 'Hesitate', 'v. t.', 'To utter with hesitation or to intimate by a reluctant\n   manner.'),
(35661, 'Hesper', 'n.', 'The evening; Hesperus.'),
(35662, 'Hesperid', 'a. & n.', 'Same as 3d Hesperian.'),
(35663, 'Hesperus', 'n.', 'Venus when she is the evening star; Hesper.'),
(35664, 'Hesperus', 'n.', 'Evening.'),
(35665, 'Hessian', 'a.', 'Of or relating to Hesse, in Germany, or to the Hessians.'),
(35666, 'Hessian', 'n.', 'A native or inhabitant of Hesse.'),
(35667, 'Hessian', 'n.', 'A mercenary or venal person.'),
(35668, 'Hessian', 'n.', 'See Hessian boots and cloth, under Hessian, a.'),
(35669, 'Hessite', 'n.', 'A lead-gray sectile mineral. It is a telluride of silver.'),
(35670, 'Hestern', 'a.', 'Alt. of Hesternal'),
(35671, 'Hetarism', 'n.', 'A supposed primitive state of society, in which all the\n   women of a tribe were held in common.'),
(35672, 'Hetchel', 'v. t.', 'Same as Hatchel.'),
(35673, 'Hetero-', '', 'A combining form signifying other, other than usual,\n   different; as, heteroclite, heterodox, heterogamous.'),
(35674, 'Hething', 'n.', 'Contempt; scorn.'),
(35675, 'Hetmans', 'pl. ', 'of Hetman'),
(35676, 'Hetman', 'n.', 'A Cossack headman or general. The title of chief hetman is\n   now held by the heir to the throne of Russia.'),
(35677, 'Heugh', 'n.', 'A crag; a cliff; a glen with overhanging sides.'),
(35678, 'Heugh', 'n.', 'A shaft in a coal pit; a hollow in a quarry.'),
(35679, 'Heved', 'n.', 'The head.'),
(35680, 'Hewed', 'imp.', 'of Hew'),
(35681, 'Hewed', 'p. p.', 'of Hew'),
(35682, 'Hewing', 'p. pr. & vb. n.', 'of Hew'),
(35683, 'Hewer', 'n.', 'One who hews.'),
(35684, 'Hewhole', 'n.', 'The European green woodpecker. See Yaffle.'),
(35685, 'Hexacid', 'a.', 'Having six atoms or radicals capable of being replaced by\n   acids; hexatomic; hexavalent; -- said of bases; as, mannite is a\n   hexacid base.'),
(35686, 'Hexad', 'n.', 'An atom whose valence is six, and which can be theoretically\n   combined with, substituted for, or replaced by, six monad atoms or\n   radicals; as, sulphur is a hexad in sulphuric acid. Also used as an\n   adjective.'),
(35687, 'Hexade', 'n.', 'A series of six numbers.'),
(35688, 'Hexagon', 'n.', 'A plane figure of six angles.'),
(35689, 'Hexagony', 'n.', 'A hexagon.'),
(35690, 'Hexane', 'n.', 'Any one of five hydrocarbons, C6H14, of the paraffin\n   series. They are colorless, volatile liquids, and are so called because\n   the molecule has six carbon atoms.'),
(35691, 'Hexapla', 'sing.', 'A collection of the Holy Scriptures in six languages or\n   six versions in parallel columns; particularly, the edition of the Old\n   Testament published by Origen, in the 3d century.'),
(35692, 'Hexapod', 'a.', 'Having six feet.'),
(35693, 'Hexapod', 'n.', 'An animal having six feet; one of the Hexapoda.'),
(35694, 'Hexapoda', 'n. pl.', 'The true, or six-legged, insects; insects other than\n   myriapods and arachnids.'),
(35695, 'Hexdecyl', 'n.', 'The essential radical, C16H33, of hecdecane.'),
(35696, 'Hexene', 'n.', 'Same as Hexylene.'),
(35697, 'Hexine', 'n.', 'A hydrocarbon, C6H10, of the acetylene series, obtained\n   artificially as a colorless, volatile, pungent liquid; -- called also\n   hexoylene.'),
(35698, 'Hexoic', 'a.', 'Pertaining to, or derived from, hexane; as, hexoic acid.'),
(35699, 'Hexone', 'n.', 'A liquid hydrocarbon, C6H8, of the valylene series,\n   obtained from distillation products of certain fats and gums.'),
(35700, 'Hexyl', 'n.', 'A compound radical, C6H13, regarded as the essential residue\n   of hexane, and a related series of compounds.'),
(35701, 'Hexylene', 'n.', 'A colorless, liquid hydrocarbon, C6H12, of the ethylene\n   series, produced artificially, and found as a natural product of\n   distillation of certain coals; also, any one several isomers of\n   hexylene proper. Called also hexene.'),
(35702, 'Hexylic', 'a.', 'Pertaining to, or derived from, hexyl or hexane; as,\n   hexylic alcohol.'),
(35703, 'Heyday', 'interj.', 'An expression of frolic and exultation, and sometimes\n   of wonder.'),
(35704, 'Heyday', 'n.', 'The time of triumph and exultation; hence, joy, high\n   spirits, frolicsomeness; wildness.'),
(35705, 'Heydeguy', 'n.', 'A kind of country-dance or round.'),
(35706, 'Heygh', 'a.', 'High.'),
(35707, 'Heyne', 'n.', 'A wretch; a rascal.'),
(35708, 'Heyten', 'adv.', 'Hence.'),
(35709, 'Hiation', 'n.', 'Act of gaping.'),
(35710, 'Hiatus', 'pl. ', 'of Hiatus'),
(35711, 'Hiatuses', 'pl. ', 'of Hiatus'),
(35712, 'Hiatus', 'n.', 'An opening; an aperture; a gap; a chasm; esp., a defect in\n   a manuscript, where some part is lost or effaced; a space where\n   something is wanting; a break.'),
(35713, 'Hiatus', 'n.', 'The concurrence of two vowels in two successive words or\n   syllables.'),
(35714, 'Hibernal', 'a.', 'Belonging or relating to winter; wintry; winterish.'),
(35715, 'Hibiscus', 'n.', 'A genus of plants (herbs, shrubs, or trees), some species\n   of which have large, showy flowers. Some species are cultivated in\n   India for their fiber, which is used as a substitute for hemp. See\n   Althea, Hollyhock, and Manoe.'),
(35716, 'Hiccough', 'n.', 'A modified respiratory movement; a spasmodic inspiration,\n   consisting of a sudden contraction of the diaphragm, accompanied with\n   closure of the glottis, so that further entrance of air is prevented,\n   while the impulse of the column of air entering and striking upon the\n   closed glottis produces a sound, or hiccough.'),
(35717, 'Hiccough', 'v. i.', 'To have a hiccough or hiccoughs.'),
(35718, 'Hickory', 'n.', 'An American tree of the genus Carya, of which there are\n   several species. The shagbark is the C. alba, and has a very rough\n   bark; it affords the hickory nut of the markets. The pignut, or brown\n   hickory, is the C. glabra. The swamp hickory is C. amara, having a nut\n   whose shell is very thin and the kernel bitter.'),
(35719, 'Hicksite', 'n.', 'A member or follower of the \"liberal\" party, headed by\n   Elias Hicks, which, because of a change of views respecting the\n   divinity of Christ and the Atonement, seceded from the conservative\n   portion of the Society of Friends in the United States, in 1827.'),
(35720, 'Hickup', 'n. & v. i.', 'See Hiccough.'),
(35721, 'Hickwall', 'n.', 'Alt. of Hickway'),
(35722, 'Hickway', 'n.', 'The lesser spotted woodpecker (Dendrocopus minor) of\n   Europe.'),
(35723, 'Hidage', 'n.', 'A tax formerly paid to the kings of England for every hide\n   of land.'),
(35724, 'Hidalgo', 'n.', 'A title, denoting a Spanish nobleman of the lower class.'),
(35725, 'Hidden', 'p. p. & a.', 'from Hide. Concealed; put out of view; secret; not\n   known; mysterious.'),
(35726, 'Hiddenly', 'adv.', 'In a hidden manner.'),
(35727, 'Hidden', 'p. p.', 'of Hide'),
(35728, 'Hiding', 'p. pr. & vb. n.', 'of Hide'),
(35729, 'Hided', 'imp. & p. p.', 'of Hide'),
(35730, 'Hiding', 'p. pr. & vb. n.', 'of Hide'),
(35731, 'Hideous', 'a.', 'Frightful, shocking, or offensive to the eyes; dreadful to\n   behold; as, a hideous monster; hideous looks.'),
(35732, 'Hideous', 'a.', 'Distressing or offensive to the ear; exciting terror or\n   dismay; as, a hideous noise.'),
(35733, 'Hideous', 'a.', 'Hateful; shocking.'),
(35734, 'Hider', 'n.', 'One who hides or conceals.'),
(35735, 'Hiding', 'n.', 'The act of hiding or concealing, or of withholding from\n   view or knowledge; concealment.'),
(35736, 'Hiding', 'n.', 'A flogging.'),
(35737, 'Hying', 'p. pr. & vb. n.', 'of Hie'),
(35738, 'Hiems', 'n.', 'Winter.'),
(35739, 'Hierarch', 'n.', 'One who has high and controlling authority in sacred\n   things; the chief of a sacred order; as, princely hierarchs.'),
(35740, 'Hieratic', 'a.', 'Consecrated to sacred uses; sacerdotal; pertaining to\n   priests.'),
(35741, 'Hieron', 'n.', 'A consecrated place; esp., a temple.'),
(35742, 'Higgled', 'imp. & p. p.', 'of Higgle'),
(35743, 'Higgling', 'p. pr. & vb. n.', 'of Higgle'),
(35744, 'Higgle', 'v. i.', 'To hawk or peddle provisions.'),
(35745, 'Higgle', 'v. i.', 'To chaffer; to stickle for small advantages in buying\n   and selling; to haggle.'),
(35746, 'Higgler', 'n.', 'One who higgles.'),
(35747, 'Highborn', 'a.', 'Of noble birth.'),
(35748, 'High-fed', 'a.', 'Pampered; fed luxuriously.'),
(35749, 'High-go', 'n.', 'A spree; a revel.'),
(35750, 'High-hoe', 'n.', 'The European green woodpecker or yaffle.'),
(35751, 'Highland', 'n.', 'Elevated or mountainous land; (often in the pl.) an\n   elevated region or country; as, the Highlands of Scotland.'),
(35752, 'High-low', 'n.', 'A laced boot, ankle high.'),
(35753, 'Highly', 'adv.', 'In a high manner, or to a high degree; very much; as,\n   highly esteemed.'),
(35754, 'Highmen', 'n. pl.', 'Loaded dice so contrived as to turn up high numbers.'),
(35755, 'Highmost', 'a.', 'Highest.'),
(35756, 'Highness', 'n.', 'The state of being high; elevation; loftiness.'),
(35757, 'Highness', 'n.', 'A title of honor given to kings, princes, or other\n   persons of rank; as, His Royal Highness.'),
(35758, 'High-red', 'a.', 'Of a strong red color.'),
(35759, 'Highroad', 'n.', 'A highway; a much traveled or main road.'),
(35760, 'Hight', 'n.', 'A variant of Height.'),
(35761, 'Hight', 'imp.', 'of Hight'),
(35762, 'Hight', 'p. p.', 'of Hight'),
(35763, 'Hoten', '', 'of Hight'),
(35764, 'Hight', 'v. t. & i.', 'To be called or named.'),
(35765, 'Hight', 'v. t. & i.', 'To command; to direct; to impel.'),
(35766, 'Hight', 'v. t. & i.', 'To commit; to intrust.'),
(35767, 'Hight', 'v. t. & i.', 'To promise.'),
(35768, 'Highth', 'n.', 'Variant of Height.'),
(35769, 'High-top', 'n.', 'A ship\'s masthead.'),
(35770, 'Highway', 'n.', 'A road or way open to the use of the public; a main road\n   or thoroughfare.'),
(35771, 'Higre', 'n.', 'See Eagre.'),
(35772, 'Hijera', 'n.', 'Alt. of Hijra'),
(35773, 'Hijra', 'n.', 'See Hegira.'),
(35774, 'Hilal', 'a.', 'Of or pertaining to a hilum.'),
