(35804, 'Hindgut', 'n.', 'The posterior part of the alimentary canal, including the\n   rectum, and sometimes the large intestine also.'),
(35805, 'Hindi', 'n.', 'The name given by Europeans to that form of the Hindustani\n   language which is chiefly spoken by native Hindoos. In employs the\n   Devanagari character, in which Sanskrit is written.'),
