(36022, 'Hoist', 'n.', 'The act of hoisting; a lift.'),
(36023, 'Hoist', 'n.', 'The perpendicular height of a flag, as opposed to the fly,\n   or horizontal length when flying from a staff.'),
(36024, 'Hoist', 'n.', 'The height of a fore-and-aft sail next the mast or stay.'),
(36025, 'Hoist', 'p. p.', 'Hoisted.'),
(36026, 'Hoistway', 'n.', 'An opening for the hoist, or elevator, in the floor of a\n   wareroom.'),
(36027, 'Hokeday', 'n.', 'Same as Hockday.'),
(36028, 'Hoker', 'n.', 'Scorn; derision; abusive talk.'),
(36029, 'Holcad', 'n.', 'A large ship of burden, in ancient Greece.'),
(36030, 'Holding', 'p. pr. & vb. n.', 'of Hold'),
(36031, 'Holden', '', 'of Hold'),
(36032, 'Holdback', 'n.', 'Check; hindrance; restraint; obstacle.'),
(36033, 'Holdback', 'n.', 'The projection or loop on the thill of a vehicle. to\n   which a strap of the harness is attached, to hold back a carriage when\n   going down hill, or in backing; also, the strap or part of the harness\n   so used.'),
(36034, 'Holder', 'n.', 'One who is employed in the hold of a vessel.'),
(36035, 'Holder', 'n.', 'One who, or that which, holds.'),
(36036, 'Holder', 'n.', 'One who holds land, etc., under another; a tenant.'),
(36037, 'Holder', 'n.', 'The payee of a bill of exchange or a promissory note, or\n   the one who owns or holds it.'),
(36038, 'Holdfast', 'n.', 'Something used to secure and hold in place something\n   else, as a long fiat-headed nail, a catch a hook, a clinch, a clamp,\n   etc.; hence, a support.'),
(36039, 'Holdfast', 'n.', 'A conical or branching body, by which a seaweed is\n   attached to its support, and differing from a root in that it is not\n   specially absorbent of moisture.'),
(36040, 'Holding', 'n.', 'The act or state of sustaining, grasping, or retaining.'),
(36041, 'Holding', 'n.', 'A tenure; a farm or other estate held of another.'),
(36042, 'Holding', 'n.', 'That which holds, binds, or influences.'),
(36043, 'Holding', 'n.', 'The burden or chorus of a song.'),
(36044, 'Holibut', 'n.', 'See Halibut.'),
(36045, 'Holidam', 'n.', 'See Halidom.'),
(36046, 'Holiday', 'n.', 'A consecrated day; religious anniversary; a day set apart\n   in honor of some person, or in commemoration of some event. See\n   Holyday.'),
(36047, 'Holiday', 'n.', 'A day of exemption from labor; a day of amusement and\n   gayety; a festival day.'),
(36048, 'Holiday', 'n.', 'A day fixed by law for suspension of business; a legal\n   holiday.'),
(36049, 'Holiday', 'a.', 'Of or pertaining to a festival; cheerful; joyous; gay.'),
(36050, 'Holiday', 'a.', 'Occurring rarely; adapted for a special occasion.'),
(36051, 'Holily', 'adv.', 'Piously; with sanctity; in a holy manner.'),
(36052, 'Holily', 'adv.', 'Sacredly; inviolably.'),
(36053, 'Holiness', 'n.', 'The state or quality of being holy; perfect moral\n   integrity or purity; freedom from sin; sanctity; innocence.'),
(36054, 'Holiness', 'n.', 'The state of being hallowed, or consecrated to God or to\n   his worship; sacredness.'),
(36055, 'Holing', 'n.', 'Undercutting in a bed of coal, in order to bring down the\n   upper mass.'),
(36056, 'Holla', 'interj.', 'Hollo.'),
(36057, 'Hollaed', 'imp. & p. p.', 'of Holla'),
(36058, 'Hollaing', 'p. pr. & vb. n.', 'of Holla'),
(36059, 'Holla', 'v. i.', 'See Hollo, v. i.'),
(36060, 'Holland', 'n.', 'A kind of linen first manufactured in Holland; a linen\n   fabric used for window shades, children\'s garments, etc.; as, brown or\n   unbleached hollands.'),
(36061, 'Hollands', 'n.', 'Gin made in Holland.'),
(36062, 'Hollands', 'n.', 'See Holland.'),
(36063, 'Hollo', 'interj. & n.', 'Ho there; stop; attend; hence, a loud cry or a\n   call to attract attention; a halloo.'),
(36064, 'Holloed', 'imp. & p. p.', 'of Hollo'),
(36065, 'Holloing', 'p. pr. & vb. n.', 'of Hollo'),
(36066, 'Hollo', 'interj.', 'To call out or exclaim; to halloo. This form is now\n   mostly replaced by hello.'),
(36067, 'Holloa', 'n. & v. i.', 'Same as Hollo.'),
(36068, 'Hollow', 'a.', 'Having an empty space or cavity, natural or artificial,\n   within a solid substance; not solid; excavated in the interior; as, a\n   hollow tree; a hollow sphere.'),
(36069, 'Hollow', 'a.', 'Depressed; concave; gaunt; sunken.'),
(36070, 'Hollow', 'a.', 'Reverberated from a cavity, or resembling such a sound;\n   deep; muffled; as, a hollow roar.'),
(36071, 'Hollow', 'a.', 'Not sincere or faithful; false; deceitful; not sound; as, a\n   hollow heart; a hollow friend.'),
(36072, 'Hollow', 'n.', 'A cavity, natural or artificial; an unfilled space within\n   anything; a hole, a cavern; an excavation; as the hollow of the hand or\n   of a tree.'),
(36073, 'Hollow', 'n.', 'A low spot surrounded by elevations; a depressed part of a\n   surface; a concavity; a channel.'),
(36074, 'Hollowed', 'imp. & p. p.', 'of Hollow'),
(36075, 'Hollow', 'v. t.', 'To make hollow, as by digging, cutting, or engraving; to\n   excavate.'),
(36076, 'Hollow', 'adv.', 'Wholly; completely; utterly; -- chiefly after the verb to\n   beat, and often with all; as, this story beats the other all hollow.\n   See All, adv.'),
(36077, 'Hollow', 'interj.', 'Hollo.'),
(36078, 'Hollow', 'v. i.', 'To shout; to hollo.'),
(36079, 'Hollow', 'v. t.', 'To urge or call by shouting.'),
(36080, 'Hollowly', 'adv.', 'Insincerely; deceitfully.'),
(36081, 'Holly', 'adv.', 'Wholly.'),
(36082, 'Holly', 'n.', 'A tree or shrub of the genus Ilex. The European species\n   (Ilex Aguifolium) is best known, having glossy green leaves, with a\n   spiny, waved edge, and bearing berries that turn red or yellow about\n   Michaelmas.'),
(36083, 'Holly', 'n.', 'The holm oak. See 1st Holm.'),
(36084, 'Holmia', 'n.', 'An oxide of holmium.'),
(36085, 'Holmium', 'n.', 'A rare element said to be contained in gadolinite.'),
(36086, 'Holmos', 'n.', 'A name given to a vase having a rounded body'),
(36087, 'Holmos', 'n.', 'A closed vessel of nearly spherical form on a high stem or\n   pedestal.'),
(36088, 'Holmos', 'n.', 'A drinking cup having a foot and stem.'),
(36089, 'Holo-', '', 'A combining form fr. Gr. \"o`los whole.'),
(36090, 'Holostei', 'n. pl.', 'An extensive division of ganoids, including the gar\n   pike, bowfin, etc.; the bony ganoids. See Illustration in Appendix.'),
(36091, 'Holour', 'n.', 'A whoremonger.'),
(36092, 'Holpen', '', 'imp. & p. p. of Help.'),
(36093, 'Holsom', 'a.', 'Wholesome.'),
(36094, 'Holster', 'n.', 'A leather case for a pistol, carried by a horseman at the\n   bow of his saddle.'),
(36095, 'Holwe', 'a.', 'Hollow.'),
(36096, 'Holyday', 'n.', 'A religious festival.'),
(36097, 'Holyday', 'n.', 'A secular festival; a holiday.'),
(36098, 'Homage', 'n.', 'A symbolical acknowledgment made by a feudal tenant to, and\n   in the presence of, his lord, on receiving investiture of fee, or\n   coming to it by succession, that he was his man, or vassal; profession\n   of fealty to a sovereign.'),
(36099, 'Homage', 'n.', 'Respect or reverential regard; deference; especially,\n   respect paid by external action; obeisance.'),
(36100, 'Homage', 'n.', 'Reverence directed to the Supreme Being; reverential\n   worship; devout affection.'),
(36101, 'Homaged', 'imp. & p. p.', 'of Homage'),
(36102, 'Homaging', 'p. pr. & vb. n.', 'of Homage'),
(36103, 'Homage', 'v. t.', 'To pay reverence to by external action.'),
(36104, 'Homage', 'v. t.', 'To cause to pay homage.'),
(36105, 'Homager', 'n.', 'One who does homage, or holds land of another by homage; a\n   vassal.'),
(36106, 'Homaloid', 'a.', 'Alt. of Homaloidal'),
(36107, 'Homarus', 'n.', 'A genus of decapod Crustacea, including the common\n   lobsters.'),
(36108, 'Homeborn', 'a.', 'Native; indigenous; not foreign.'),
(36109, 'Homeborn', 'a.', 'Of or pertaining to the home or family.'),
(36110, 'Homeless', 'a.', 'Destitute of a home.'),
(36111, 'Homelike', 'a.', 'Like a home; comfortable; cheerful; cozy; friendly.'),
(36112, 'Homelily', 'adv.', 'Plainly; inelegantly.'),
(36113, 'Homeling', 'n.', 'A person or thing belonging to a home or to a particular\n   country; a native; as, a word which is a homeling.'),
(36114, 'Homely', 'n.', 'Belonging to, or having the characteristics of, home;\n   domestic; familiar; intimate.'),
(36115, 'Homely', 'n.', 'Plain; unpretending; rude in appearance; unpolished; as, a\n   homely garment; a homely house; homely fare; homely manners.'),
(36116, 'Homely', 'n.', 'Of plain or coarse features; uncomely; -- contrary to\n   handsome.'),
(36117, 'Homely', 'adv.', 'Plainly; rudely; coarsely; as, homely dressed.'),
(36118, 'Homelyn', 'n.', 'The European sand ray (Raia maculata); -- called also\n   home, mirror ray, and rough ray.'),
(36119, 'Homemade', 'a.', 'Made at home; of domestic manufacture; made either in a\n   private family or in one\'s own country.'),
(36120, 'Homer', 'n.', 'A carrier pigeon remarkable for its ability to return home\n   from a distance.'),
(36121, 'Homer', 'n.', 'See Hoemother.'),
(36122, 'Homer', 'n.', 'A Hebrew measure containing, as a liquid measure, ten baths,\n   equivalent to fifty-five gallons, two quarts, one pint; and, as a dry\n   measure, ten ephahs, equivalent to six bushels, two pecks, four quarts.'),
(36123, 'Homeric', 'a.', 'Of or pertaining to Homer, the most famous of Greek poets;\n   resembling the poetry of Homer.'),
(36124, 'Homesick', 'a.', 'Pining for home; in a nostalgic condition.'),
(36125, 'Homespun', 'a.', 'Spun or wrought at home; of domestic manufacture; coarse;\n   plain.'),
(36126, 'Homespun', 'a.', 'Plain in manner or style; not elegant; rude; coarse.'),
(36127, 'Homespun', 'n.', 'Cloth made at home; as, he was dressed in homespun.'),
(36128, 'Homespun', 'n.', 'An unpolished, rustic person.'),
(36129, 'Homeward', 'a.', 'Being in the direction of home; as, the homeward way.'),
(36130, 'Homeward', 'adv.', 'Alt. of Homewards'),
(36131, 'Homicide', 'v. t.', 'The killing of one human being by another.'),
(36132, 'Homicide', 'v. t.', 'One who kills another; a manslayer.'),
(36133, 'Homiform', 'a.', 'In human form.'),
(36134, 'Homilete', 'n.', 'A homilist.'),
(36135, 'Homilist', 'n.', 'One who prepares homilies; one who preaches to a\n   congregation.'),
(36136, 'Homilite', 'n.', 'A borosilicate of iron and lime, near datolite in form\n   and composition.'),
(36137, 'Homilies', 'pl. ', 'of Homily'),
(36138, 'Homily', 'n.', 'A discourse or sermon read or pronounced to an audience; a\n   serious discourse.'),
(36139, 'Homily', 'n.', 'A serious or tedious exhortation in private on some moral\n   point, or on the conduct of life.'),
(36140, 'Homing', 'a.', 'Home-returning; -- used specifically of carrier pigeons.'),
(36141, 'Hominy', 'n.', 'Maize hulled and broken, and prepared for food by being\n   boiled in water.'),
(36142, 'Homish', 'a.', 'Like a home or a home circle.'),
(36143, 'Hommock', 'n.', 'A small eminence of a conical form, of land or of ice; a\n   knoll; a hillock. See Hummock.'),
(36144, 'Hommocky', 'a.', 'Filled with hommocks; piled in the form of hommocks; --\n   said of ice.'),
(36145, 'Homo-', '', 'A combining form from Gr. \"omo`s, one and the same, common,\n   joint.'),
(36146, 'Homodont', 'a.', 'Having all the teeth similar in front, as in the\n   porpoises; -- opposed to heterodont.'),
(36147, 'Homogamy', 'n.', 'The condition of being homogamous.'),
(36148, 'Homogene', 'a.', 'Homogeneous.'),
(36149, 'Homogeny', 'n.', 'Joint nature.'),
(36150, 'Homogeny', 'n.', 'The correspondence of common descent; -- a term used to\n   supersede homology by Lankester, who also used homoplasy to denote any\n   superinduced correspondence of position and structure in parts\n   embryonically distinct (other writers using the term homoplasmy). Thus,\n   there is homogeny between the fore limb of a mammal and the wing of a\n   bird; but the right and left ventricles of the heart in both are only\n   in homoplasy with each other, these having arisen independently since\n   the divergence of both groups from a univentricular ancestor.'),
(36151, 'Homogony', 'n.', 'The condition of having homogonous flowers.'),
(36152, 'Homology', 'n.', 'The quality of being homologous; correspondence;\n   relation; as, the homologyof similar polygons.'),
(36153, 'Homology', 'n.', 'Correspondence or relation in type of structure in\n   contradistinction to similarity of function; as, the relation in\n   structure between the leg and arm of a man; or that between the arm of\n   a man, the fore leg of a horse, the wing of a bird, and the fin of a\n   fish, all these organs being modifications of one type of structure.'),
(36154, 'Homology', 'n.', 'The correspondence or resemblance of substances belonging\n   to the same type or series; a similarity of composition varying by a\n   small, regular difference, and usually attended by a regular variation\n   in physical properties; as, there is an homology between methane, CH4,\n   ethane, C2H6, propane, C3H8, etc., all members of the paraffin series.\n   In an extended sense, the term is applied to the relation between\n   chemical elements of the same group; as, chlorine, bromine, and iodine\n   are said to be in homology with each other. Cf. Heterology.'),
(36155, 'Homonomy', 'n.', 'The homology of parts arranged on transverse axes.'),
(36156, 'Homonym', 'n.', 'A word having the same sound as another, but differing\n   from it in meaning; as the noun bear and the verb bear.'),
(36157, 'Homonymy', 'n.', 'Sameness of name or designation; identity in relations.'),
(36158, 'Homonymy', 'n.', 'Sameness of name or designation of things or persons\n   which are different; ambiguity.'),
(36159, 'Homopter', 'n.', 'One of the Homoptera.'),
(36160, 'Homotaxy', 'n.', 'Same as Homotaxis.'),
(36161, 'Homotype', 'n.', 'That which has the same fundamental type of structure\n   with something else; thus, the right arm is the homotype of the right\n   leg; one arm is the homotype of the other, etc.'),
(36162, 'Homotypy', 'n.', 'A term suggested by Haeckel to be instead of serial\n   homology. See Homotype.'),
(36163, 'Honed', 'imp. & p. p.', 'of Hone'),
(36164, 'Honing', 'p]. pr. & vb. n.', 'of Hone'),
(36165, 'Honest', 'a.', 'Decent; honorable; suitable; becoming.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(36166, 'Honest', 'a.', 'Characterized by integrity or fairness and\n   straight/forwardness in conduct, thought, speech, etc.; upright; just;\n   equitable; trustworthy; truthful; sincere; free from fraud, guile, or\n   duplicity; not false; -- said of persons and acts, and of things to\n   which a moral quality is imputed; as, an honest judge or merchant; an\n   honest statement; an honest bargain; an honest business; an honest\n   book; an honest confession.'),
(36167, 'Honest', 'a.', 'Open; frank; as, an honest countenance.'),
(36168, 'Honest', 'a.', 'Chaste; faithful; virtuous.'),
(36169, 'Honest', 'a.', 'To adorn; to grace; to honor; to make becoming,\n   appropriate, or honorable.'),
(36170, 'Honestly', 'adv.', 'Honorably; becomingly; decently.'),
(36171, 'Honestly', 'adv.', 'In an honest manner; as, a contract honestly made; to\n   live honestly; to speak honestly.'),
(36172, 'Honesty', 'a.', 'Honor; honorableness; dignity; propriety; suitableness;\n   decency.'),
(36173, 'Honesty', 'a.', 'The quality or state of being honest; probity; fairness\n   and straightforwardness of conduct, speech, etc.; integrity; sincerity;\n   truthfulness; freedom from fraud or guile.'),
(36174, 'Honesty', 'a.', 'Chastity; modesty.'),
(36175, 'Honesty', 'a.', 'Satin flower; the name of two cruciferous herbs having\n   large flat pods, the round shining partitions of which are more\n   beautiful than the blossom; -- called also lunary and moonwort. Lunaria\n   biennis is common honesty; L. rediva is perennial honesty.'),
(36176, 'Honewort', 'n.', 'An umbelliferous plant of the genus Sison (S. Amomum); --\n   so called because used to cure a swelling called a hone.'),
(36177, 'Honey', 'n.', 'A sweet viscid fluid, esp. that collected by bees from\n   flowers of plants, and deposited in the cells of the honeycomb.'),
(36178, 'Honey', 'n.', 'That which is sweet or pleasant, like honey.'),
(36179, 'Honey', 'n.', 'Sweet one; -- a term of endearment.'),
(36180, 'Honeyed', 'imp. & p. p.', 'of Honey'),
(36181, 'Honeying', 'p. pr. & vb. n.', 'of Honey'),
(36182, 'Honey', 'v. i.', 'To be gentle, agreeable, or coaxing; to talk fondly; to\n   use endearments; also, to be or become obsequiously courteous or\n   complimentary; to fawn.'),
(36183, 'Honey', 'v. t.', 'To make agreeable; to cover or sweeten with, or as with,\n   honey.'),
(36184, 'Honeybee', 'n.', 'Any bee of the genus Apis, which lives in communities and\n   collects honey, esp. the common domesticated hive bee (Apis mellifica),\n   the Italian bee (A. ligustica), and the Arabiab bee (A. fasciata). The\n   two latter are by many entomologists considered only varieties of the\n   common hive bee. Each swarm of bees consists of a large number of\n   workers (barren females), with, ordinarily, one queen or fertile\n   female, but in the swarming season several young queens, and a number\n   of males or drones, are produced.'),
(36185, 'Honeydew', 'n.', 'A sweet, saccharine substance, found on the leaves of\n   trees and other plants in small drops, like dew. Two substances have\n   been called by this name; one exuded from the plants, and the other\n   secreted by certain insects, esp. aphids.'),
(36186, 'Honeydew', 'n.', 'A kind of tobacco moistened with molasses.'),
(36187, 'Honeyed', 'a.', 'Covered with honey.'),
(36188, 'Honeyed', 'a.', 'Sweet, as, honeyed words.'),
(36189, 'Honied', 'a.', 'See Honeyed.'),
(36190, 'Honor', 'n.', 'Esteem due or paid to worth; high estimation; respect;\n   consideration; reverence; veneration; manifestation of respect or\n   reverence.'),
(36191, 'Honor', 'n.', 'That which rightfully attracts esteem, respect, or\n   consideration; self-respect; dignity; courage; fidelity; especially,\n   excellence of character; high moral worth; virtue; nobleness; specif.,\n   in men, integrity; uprightness; trustworthness; in women, purity;\n   chastity.'),
(36192, 'Honor', 'n.', 'A nice sense of what is right, just, and true, with course\n   of life correspondent thereto; strict conformity to the duty imposed by\n   conscience, position, or privilege.'),
(36193, 'Honor', 'n.', 'That to which esteem or consideration is paid; distinguished\n   position; high rank.'),
(36194, 'Honor', 'n.', 'Fame; reputation; credit.'),
(36195, 'Honor', 'n.', 'A token of esteem paid to worth; a mark of respect; a\n   ceremonial sign of consideration; as, he wore an honor on his breast;\n   military honors; civil honors.'),
(36196, 'Honor', 'n.', 'A cause of respect and fame; a glory; an excellency; an\n   ornament; as, he is an honor to his nation.'),
(36197, 'Honor', 'n.', 'A title applied to the holders of certain honorable civil\n   offices, or to persons of rank; as, His Honor the Mayor. See Note under\n   Honorable.'),
(36198, 'Honor', 'n.', 'A seigniory or lordship held of the king, on which other\n   lordships and manors depended.'),
(36199, 'Honor', 'n.', 'Academic or university prizes or distinctions; as, honors in\n   classics.'),
(36200, 'Honor', 'n.', 'The ace, king, queen, and jack of trumps. The ten and nine\n   are sometimes called Dutch honors.'),
(36201, 'Honored', 'imp. & p. p.', 'of Honor'),
(36202, 'Honoring', 'p. pr. & vb. n.', 'of Honor'),
(36203, 'Honor', 'n.', 'To regard or treat with honor, esteem, or respect; to\n   revere; to treat with deference and submission; when used of the\n   Supreme Being, to reverence; to adore; to worship.'),
(36204, 'Honor', 'n.', 'To dignify; to raise to distinction or notice; to bestow\n   honor upon; to elevate in rank or station; to ennoble; to exalt; to\n   glorify; hence, to do something to honor; to treat in a complimentary\n   manner or with civility.'),
(36205, 'Honor', 'n.', 'To accept and pay when due; as, to honora bill of exchange.'),
(36206, 'Honorary', 'a.', 'A fee offered to professional men for their services; as,\n   an honorarium of one thousand dollars.'),
(36207, 'Honorary', 'a.', 'An honorary payment, usually in recognition of services\n   for which it is not usual or not lawful to assign a fixed business\n   price.'),
(36208, 'Honorary', 'a.', 'Done as a sign or evidence of honor; as, honorary\n   services.'),
(36209, 'Honorary', 'a.', 'Conferring honor, or intended merely to confer honor\n   without emolument; as, an honorary degree.'),
(36210, 'Honorary', 'a.', 'Holding a title or place without rendering service or\n   receiving reward; as, an honorary member of a society.'),
(36211, 'Honorer', 'n.', 'One who honors.'),
(36212, '-hood', '', 'A termination denoting state, condition, quality, character,\n   totality, as in manhood, childhood, knighthood, brotherhood. Sometimes\n   it is written, chiefly in obsolete words, in the form -head.'),
(36213, 'Hooded', 'imp. & p. p.', 'of Hood'),
(36214, 'Hooding', 'p. pr. & vb. n.', 'of Hood'),
(36215, 'Hoodcap', 'n.', 'See Hooded seal, under Hooded.'),
(36216, 'Hooded', 'a.', 'Covered with a hood.'),
(36217, 'Hooded', 'a.', 'Furnished with a hood or something like a hood.'),
(36218, 'Hooded', 'a.', 'Hood-shaped; esp. (Bot.), rolled up like a cornet of paper;\n   cuculate, as the spethe of the Indian turnip.'),
(36219, 'Hooded', 'a.', 'Having the head conspicuously different in color from the\n   rest of the plumage; -- said of birds.'),
(36220, 'Hooded', 'a.', 'Having a hoodlike crest or prominence on the head or neck;\n   as, the hooded seal; a hooded snake.'),
(36221, 'Hoodless', 'a.', 'Having no hood.'),
(36222, 'Hoodlum', 'n.', 'A young rowdy; a rough, lawless fellow.'),
(36223, 'Hoodman', 'n.', 'The person blindfolded in the game called hoodman-blind.'),
(36224, 'Hoodoo', 'n.', 'One who causes bad luck.'),
(36225, 'Hoodwink', 'v. t.', 'To blind by covering the eyes.'),
(36226, 'Hoodwink', 'v. t.', 'To cover; to hide.'),
(36227, 'Hoodwink', 'v. t.', 'To deceive by false appearance; to impose upon.'),
(36228, 'Hoody', 'n.', 'The hooded crow; also, in Scotland, the hooded gull.'),
(36229, 'Hoofs', 'pl. ', 'of Hoof'),
(36230, 'Hooves', 'pl. ', 'of Hoof'),
(36231, 'Hoofed', 'a.', 'Furnished with hoofs.'),
(36232, 'Hoofless', 'a.', 'Destitute of hoofs.'),
(36233, 'Hooked', 'imp. & p. p.', 'of Hook'),
(36234, 'Hooking', 'p. pr. & vb. n.', 'of Hook'),
(36235, 'Hookah', 'n.', 'A pipe with a long, flexible stem, so arranged that the\n   smoke is cooled by being made to pass through water.'),
(36236, 'Hooked', 'a.', 'Having the form of a hook; curvated; as, the hooked bill of\n   a bird.'),
(36237, 'Hooked', 'a.', 'Provided with a hook or hooks.'),
(36238, 'Hooker', 'n.', 'One who, or that which, hooks.'),
(36239, 'Hooker', 'n.', 'A Dutch vessel with two masts.'),
(36240, 'Hooker', 'n.', 'A fishing boat with one mast, used on the coast of Ireland.'),
(36241, 'Hooker', 'n.', 'A sailor\'s contemptuous term for any antiquated craft.'),
(36242, 'Hookey', 'n.', 'See Hockey.'),
(36243, 'Hooklet', 'n.', 'A little hook.'),
(36244, 'Hooky', 'a.', 'Full of hooks; pertaining to hooks.'),
(36245, 'Hoolock', 'n.', 'A small black gibbon (Hylobates hoolock), found in the\n   mountains of Assam.'),
(36246, 'Hooped', 'imp. & p. p.', 'of Hoop'),
(36247, 'Hooping', 'p. pr. & vb. n.', 'of Hoop'),
(36248, 'Hooper', 'n.', 'One who hoops casks or tubs; a cooper.'),
(36249, 'Hooper', 'n.', 'The European whistling, or wild, swan (Olor cygnus); --\n   called also hooper swan, whooping swan, and elk.'),
(36250, 'Hoopoe', 'n.', 'Alt. of Hoopoo'),
(36251, 'Hoopoo', 'n.', 'A European bird of the genus Upupa (U. epops), having a\n   beautiful crest, which it can erect or depress at pleasure. Called also\n   hoop, whoop. The name is also applied to several other species of the\n   same genus and allied genera.'),
(36252, 'Hoosier', 'n.', 'A nickname given to an inhabitant of the State of Indiana.'),
(36253, 'Hooted', 'imp. & p. p.', 'of Hoot'),
(36254, 'Hooting', 'p. pr. & vb. n.', 'of Hoot'),
(36255, 'Hoove', 'n.', 'A disease in cattle consisting in inflammation of the\n   stomach by gas, ordinarily caused by eating too much green food;\n   tympany; bloating.'),
(36256, 'Hooven', 'a.', 'Alt. of Hoven'),
(36257, 'Hoven', 'a.', 'Affected with hoove; as, hooven, or hoven, cattle.'),
(36258, 'Hopped', 'imp. & p. p.', 'of Hop'),
(36259, 'Hopping', 'p. pr. & vb. n.', 'of Hop'),
(36260, 'Hopbine', 'n.', 'Alt. of Hopbind'),
(36261, 'Hopbind', 'n.', 'The climbing stem of the hop.'),
(36262, 'Hoped', 'imp. & p. p.', 'of Hope'),
(36263, 'Hoping', 'p. pr. & vb. n.', 'of Hope'),
(36264, 'Hopeful', 'a.', 'Full of hope, or agreeable expectation; inclined to hope;\n   expectant.'),
(36265, 'Hopeful', 'a.', 'Having qualities which excite hope; affording promise of\n   good or of success; as, a hopeful youth; a hopeful prospect.'),
(36266, 'Hopeite', 'n.', 'A hydrous phosphate of zinc in transparent prismatic\n   crystals.'),
(36267, 'Hopeless', 'a.', 'Destitute of hope; having no expectation of good;\n   despairing.'),
(36268, 'Hopeless', 'a.', 'Giving no ground of hope; promising nothing desirable;\n   desperate; as, a hopeless cause.'),
(36269, 'Hopeless', 'a.', 'Unhoped for; despaired of.'),
(36270, 'Hoper', 'n.', 'One who hopes.'),
(36271, 'Hopingly', 'adv.', 'In a hopeful manner.'),
(36272, 'Hoplite', 'n.', 'A heavy-armed infantry soldier.'),
(36273, 'Hopped', 'p. a.', 'Impregnated with hops.'),
(36274, 'Hopper', 'n.', 'One who, or that which, hops.'),
(36275, 'Hopper', 'n.', 'A chute, box, or receptacle, usually funnel-shaped with an\n   opening at the lower part, for delivering or feeding any material, as\n   to a machine; as, the wooden box with its trough through which grain\n   passes into a mill by joining or shaking, or a funnel through which\n   fuel passes into a furnace, or coal, etc., into a car.'),
(36276, 'Hopper', 'n.', 'See Grasshopper, 2.'),
(36277, 'Hopper', 'n.', 'A game. See Hopscotch.'),
(36278, 'Hopper', 'n.', 'See Grasshopper, and Frog hopper, Grape hopper, Leaf\n   hopper, Tree hopper, under Frog, Grape, Leaf, and Tree.'),
(36279, 'Hopper', 'n.', 'The larva of a cheese fly.'),
(36280, 'Hopper', 'n.', 'A vessel for carrying waste, garbage, etc., out to sea, so\n   constructed as to discharge its load by a mechanical contrivance; --\n   called also dumping scow.'),
(36281, 'Hoppet', 'n.', 'A hand basket; also, a dish used by miners for measuring\n   ore.'),
(36282, 'Hoppet', 'n.', 'An infant in arms.'),
(36283, 'Hopping', 'n.', 'The act of one who, or that which, hops; a jumping,\n   frisking, or dancing.'),
(36284, 'Hopping', 'n.', 'A gathering of hops.'),
(36285, 'Hoppled', 'imp. & p. p.', 'of Hopple'),
(36286, 'Hoppling', 'p. pr. & vb. n.', 'of Hopple'),
(36287, 'Hopple', 'v. t.', 'To impede by a hopple; to tie the feet of (a horse or a\n   cow) loosely together; to hamper; to hobble; as, to hopple an unruly or\n   straying horse.'),
(36288, 'Hopple', 'v. t.', 'Fig.: To entangle; to hamper.'),
(36289, 'Hopple', 'n.', 'A fetter for horses, or cattle, when turned out to graze;\n   -- chiefly used in the plural.'),
(36290, 'Hoppo', 'n.', 'A collector of customs, as at Canton; an overseer of\n   commerce.'),
(36291, 'Hoppo', 'n.', 'A tribunal or commission having charge of the revenue\n   derived from trade and navigation.'),
(36292, 'Hopyard', 'n.', 'A field where hops are raised.'),
(36293, 'Horal', 'a.', 'Of or pertaining to an hour, or to hours.'),
(36294, 'Horaly', 'adv.', 'Hourly.'),
(36295, 'Horary', 'a.', 'Of or pertaining to an hour; noting the hours.'),
(36296, 'Horary', 'a.', 'Occurring once an hour; continuing an hour; hourly;\n   ephemeral.'),
(36297, 'Horatian', 'a.', 'Of or pertaining to Horace, the Latin poet, or resembling\n   his style.'),
(36298, 'Horde', 'n.', 'A wandering troop or gang; especially, a clan or tribe of a\n   nomadic people migrating from place to place for the sake of pasturage,\n   plunder, etc.; a predatory multitude.'),
(36299, 'Hordeic', 'a.', 'Pertaining to, or derived from, barley; as, hordeic acid,\n   an acid identical or isomeric with lauric acid.'),
(36300, 'Hordein', 'n.', 'A peculiar starchy matter contained in barley. It is\n   complex mixture.'),
(36301, 'Hordock', 'n.', 'An unidentified plant mentioned by Shakespeare, perhaps\n   equivalent to burdock.'),
(36302, 'Horizon', 'n.', 'The circle which bounds that part of the earth\'s surface\n   visible to a spectator from a given point; the apparent junction of the\n   earth and sky.'),
(36303, 'Horizon', 'n.', 'A plane passing through the eye of the spectator and at\n   right angles to the vertical at a given place; a plane tangent to the\n   earth\'s surface at that place; called distinctively the sensible\n   horizon.'),
(36304, 'Horizon', 'n.', 'A plane parallel to the sensible horizon of a place, and\n   passing through the earth\'s center; -- called also rational / celestial\n   horizon.'),
(36305, 'Horizon', 'n.', 'The unbroken line separating sky and water, as seen by an\n   eye at a given elevation, no land being visible.'),
(36306, 'Horizon', 'n.', 'The epoch or time during which a deposit was made.'),
(36307, 'Horizon', 'n.', 'The chief horizontal line in a picture of any sort, which\n   determines in the picture the height of the eye of the spectator; in an\n   extended landscape, the representation of the natural horizon\n   corresponds with this line.'),
(36308, 'Hornbeak', 'n.', 'A fish. See Hornfish.'),
(36309, 'Hornbeam', 'n.', 'A tree of the genus Carpinus (C. Americana), having a\n   smooth gray bark and a ridged trunk, the wood being white and very\n   hard. It is common along the banks of streams in the United States, and\n   is also called ironwood. The English hornbeam is C. Betulus. The\n   American is called also blue beech and water beech.'),
(36310, 'Hornbill', 'n.', 'Any bird of the family Bucerotidae, of which about sixty\n   species are known, belonging to numerous genera. They inhabit the\n   tropical parts of Asia, Africa, and the East Indies, and are remarkable\n   for having a more or less horn-like protuberance, which is usually\n   large and hollow and is situated on the upper side of the beak. The\n   size of the hornbill varies from that of a pigeon to that of a raven,\n   or even larger. They feed chiefly upon fruit, but some species eat dead\n   animals.'),
(36311, 'Hornbook', 'n.', 'The first book for children, or that from which in former\n   times they learned their letters and rudiments; -- so called because a\n   sheet of horn covered the small, thin board of oak, or the slip of\n   paper, on which the alphabet, digits, and often the Lord\'s Prayer, were\n   written or printed; a primer.'),
(36312, 'Hornbook', 'n.', 'A book containing the rudiments of any science or branch\n   of knowledge; a manual; a handbook.'),
(36313, 'Hornbug', 'n.', 'A large nocturnal beetle of the genus Lucanus (as L.\n   capreolus, and L. dama), having long, curved upper jaws, resembling a\n   sickle. The grubs are found in the trunks of old trees.'),
(36314, 'Horned', 'a.', 'Furnished with a horn or horns; furnished with a hornlike\n   process or appendage; as, horned cattle; having some part shaped like a\n   horn.'),
(36315, 'Hornel', 'n.', 'The European sand eel.'),
(36316, 'Horner', 'n.', 'One who works or deal in horn or horns.'),
(36317, 'Horner', 'n.', 'One who winds or blows the horn.'),
(36318, 'Horner', 'n.', 'One who horns or cuckolds.'),
(36319, 'Horner', 'n.', 'The British sand lance or sand eel (Ammodytes lanceolatus).'),
(36320, 'Hornet', 'n.', 'A large, strong wasp. The European species (Vespa crabro)\n   is of a dark brown and yellow color. It is very pugnacious, and its\n   sting is very severe. Its nest is constructed of a paperlike material,\n   and the layers of comb are hung together by columns. The American\n   white-faced hornet (V. maculata) is larger and has similar habits.'),
(36321, 'Hornfish', 'n.', 'The garfish or sea needle.'),
(36322, 'Hornfoot', 'a.', 'Having hoofs; hoofed.'),
(36323, 'Hornify', 'v. t.', 'To horn; to cuckold.'),
(36324, 'Horning', 'n.', 'Appearance of the moon when increasing, or in the form of\n   a crescent.'),
(36325, 'Hornish', 'a.', 'Somewhat like horn; hard.'),
(36326, 'Hornito', 'n.', 'A low, oven-shaped mound, common in volcanic regions, and\n   emitting smoke and vapors from its sides and summit.'),
(36327, 'Hornless', 'a.', 'Having no horn.'),
(36328, 'Horn-mad', 'a.', 'Quite mad; -- raving crazy.'),
(36329, 'Hornowl', 'n.', 'See Horned Owl.'),
(36330, 'Hornpike', 'n.', 'The garfish.'),
(36331, 'Hornpipe', 'n.', 'An instrument of music formerly popular in Wales,\n   consisting of a wooden pipe, with holes at intervals. It was so called\n   because the bell at the open end was sometimes made of horn.'),
(36332, 'Hornpipe', 'n.', 'A lively tune played on a hornpipe, for dancing; a tune\n   adapted for such playing.'),
(36333, 'Hornpout', 'n.', 'See Horned pout, under Horned.'),
(36334, 'Horntail', 'n.', 'Any one of family (Uroceridae) of large hymenopterous\n   insects, allied to the sawflies. The larvae bore in the wood of trees.\n   So called from the long, stout ovipositors of the females.'),
(36335, 'Hornwork', 'n.', 'An outwork composed of two demibastions joined by a\n   curtain. It is connected with the works in rear by long wings.'),
(36336, 'Hornwort', 'n.', 'An aquatic plant (Ceratophyllum), with finely divided\n   leaves.'),
(36337, 'Horny', 'superl.', 'Having horns or hornlike projections.'),
(36338, 'Horny', 'superl.', 'Composed or made of horn, or of a substance resembling\n   horn; of the nature of horn.'),
(36339, 'Horny', 'superl.', 'Hard; callous.'),
(36340, 'Horologe', 'n.', 'A servant who called out the hours.'),
(36341, 'Horologe', 'n.', 'An instrument indicating the time of day; a timepiece of\n   any kind; a watch, clock, or dial.'),
(36342, 'Horology', 'n.', 'The science of measuring time, or the principles and art\n   of constructing instruments for measuring and indicating portions of\n   time, as clocks, watches, dials, etc.'),
(36343, 'Horopter', 'n.', 'The line or surface in which are situated all the points\n   which are seen single while the point of sight, or the adjustment of\n   the eyes, remains unchanged.'),
(36344, 'Horrent', 'a.', 'Standing erect, as bristles; covered with bristling\n   points; bristled; bristling.'),
(36345, 'Horrible', 'a.', 'Exciting, or tending to excite, horror or fear; dreadful;\n   terrible; shocking; hideous; as, a horrible sight; a horrible story; a\n   horrible murder.'),
(36346, 'Horribly', 'adv.', 'In a manner to excite horror; dreadfully; terribly.'),
(36347, 'Horrid', 'a.', 'Rough; rugged; bristling.'),
(36348, 'Horrid', 'a.', 'Fitted to excite horror; dreadful; hideous; shocking;\n   hence, very offensive.'),
(36349, 'Horridly', 'adv.', 'In a horrid manner.'),
(36350, 'Horrific', 'a.', 'Causing horror; frightful.'),
(36351, 'Horrify', 'v. t.', 'To cause to feel horror; to strike or impress with\n   horror; as, the sight horrified the beholders.'),
(36352, 'Horror', 'n.', 'A bristling up; a rising into roughness; tumultuous\n   movement.'),
(36353, 'Horror', 'n.', 'A shaking, shivering, or shuddering, as in the cold fit\n   which precedes a fever; in old medical writings, a chill of less\n   severity than a rigor, and more marked than an algor.'),
(36354, 'Horror', 'n.', 'A painful emotion of fear, dread, and abhorrence; a\n   shuddering with terror and detestation; the feeling inspired by\n   something frightful and shocking.'),
(36355, 'Horror', 'n.', 'That which excites horror or dread, or is horrible; gloom;\n   dreariness.'),
(36356, 'Horse', 'n.', 'A hoofed quadruped of the genus Equus; especially, the\n   domestic horse (E. caballus), which was domesticated in Egypt and Asia\n   at a very early period. It has six broad molars, on each side of each\n   jaw, with six incisors, and two canine teeth, both above and below. The\n   mares usually have the canine teeth rudimentary or wanting. The horse\n   differs from the true asses, in having a long, flowing mane, and the\n   tail bushy to the base. Unlike the asses it has callosities, or\n   chestnuts, on all its legs. The horse excels in strength, speed,\n   docility, courage, and nobleness of character, and is used for drawing,\n   carrying, bearing a rider, and like purposes.'),
(36357, 'Horse', 'n.', 'The male of the genus horse, in distinction from the female\n   or male; usually, a castrated male.'),
(36358, 'Horse', 'n.', 'Mounted soldiery; cavalry; -- used without the plural\n   termination; as, a regiment of horse; -- distinguished from foot.'),
(36359, 'Horse', 'n.', 'A frame with legs, used to support something; as, a\n   clotheshorse, a sawhorse, etc.'),
(36360, 'Horse', 'n.', 'A frame of timber, shaped like a horse, on which soldiers\n   were made to ride for punishment.'),
(36361, 'Horse', 'n.', 'Anything, actual or figurative, on which one rides as on a\n   horse; a hobby.'),
(36362, 'Horse', 'n.', 'A mass of earthy matter, or rock of the same character as\n   the wall rock, occurring in the course of a vein, as of coal or ore;\n   hence, to take horse -- said of a vein -- is to divide into branches\n   for a distance.'),
(36363, 'Horse', 'n.', 'See Footrope, a.'),
(36364, 'Horse', 'a.', 'A breastband for a leadsman.'),
(36365, 'Horse', 'a.', 'An iron bar for a sheet traveler to slide upon.'),
(36366, 'Horse', 'a.', 'A jackstay.'),
(36367, 'Horsed', 'imp. & p. p.', 'of Horse'),
(36368, 'Horsing', 'p. pr. & vb. n.', 'of Horse'),
(36369, 'Horse', 'v. t.', 'To provide with a horse, or with horses; to mount on, or\n   as on, a horse.'),
(36370, 'Horse', 'v. t.', 'To sit astride of; to bestride.'),
(36371, 'Horse', 'v. t.', 'To cover, as a mare; -- said of the male.'),
(36372, 'Horse', 'v. t.', 'To take or carry on the back; as, the keeper, horsing a\n   deer.'),
(36373, 'Horse', 'v. t.', 'To place on the back of another, or on a wooden horse,\n   etc., to be flogged; to subject to such punishment.'),
(36374, 'Horse', 'v. i.', 'To get on horseback.'),
(36375, 'Horsefly', 'n.', 'Any dipterous fly of the family Tabanidae, that stings\n   horses, and sucks their blood.'),
(36376, 'Horsefly', 'n.', 'The horse tick or forest fly (Hippobosca).'),
(36377, 'Horsemen', 'pl. ', 'of Horseman'),
(36378, 'Horseman', 'n.', 'A rider on horseback; one skilled in the management of\n   horses; a mounted man.'),
(36379, 'Horseman', 'n.', 'A mounted soldier; a cavalryman.'),
(36380, 'Horseman', 'n.', 'A land crab of the genus Ocypoda, living on the coast of\n   Brazil and the West Indies, noted for running very swiftly.'),
(36381, 'Horseman', 'n.', 'A West Indian fish of the genus Eques, as the\n   light-horseman (E. lanceolatus).'),
(36382, 'Horsly', 'a.', 'Horselike.'),
(36383, 'Horsy', 'a.', 'Pertaining to, or suggestive of, a horse, or of horse\n   racing; as, horsy manners; garments of fantastically horsy fashions.'),
(36384, 'Hortulan', 'a.', 'Belonging to a garden.'),
(36385, 'Hortyard', 'n.', 'An orchard.'),
(36386, 'Hosannas', 'pl. ', 'of Hosanna'),
(36387, 'Hosanna', 'n.', 'A Hebrew exclamation of praise to the Lord, or an\n   invocation of blessings.'),
(36388, 'Hosen', 'pl. ', 'of Hose'),
(36389, 'Hosen', 'n. pl.', 'See Hose.'),
(36390, 'Hosier', 'n.', 'One who deals in hose or stocking, or in goods knit or\n   woven like hose.'),
(36391, 'Hosiery', 'n.', 'The business of a hosier.'),
(36392, 'Hosiery', 'n.', 'Stockings, in general; goods knit or woven like hose.'),
(36393, 'Hospice', 'n.', 'A convent or monastery which is also a place of refuge or\n   entertainment for travelers on some difficult road or pass, as in the\n   Alps; as, the Hospice of the Great St. Bernard.'),
(36394, 'Hospital', 'n.', 'A place for shelter or entertainment; an inn.'),
(36395, 'Hospital', 'n.', 'A building in which the sick, injured, or infirm are\n   received and treated; a public or private institution founded for\n   reception and cure, or for the refuge, of persons diseased in body or\n   mind, or disabled, infirm, or dependent, and in which they are treated\n   either at their own expense, or more often by charity in whole or in\n   part; a tent, building, or other place where the sick or wounded of an\n   army cared for.'),
(36396, 'Hospital', 'a.', 'Hospitable.'),
(36397, 'Hospodar', 'n.', 'A title borne by the princes or governors of Moldavia and\n   Wallachia before those countries were united as Roumania.'),
(36398, 'Hostage', 'n.', 'A person given as a pledge or security for the performance\n   of the conditions of a treaty or stipulations of any kind, on the\n   performance of which the person is to be released.'),
(36399, 'Hostel', 'n.', 'An inn.'),
(36400, 'Hostel', 'n.', 'A small, unendowed college in Oxford or Cambridge.'),
(36401, 'Hosteler', 'n.', 'The keeper of a hostel or inn.'),
(36402, 'Hosteler', 'n.', 'A student in a hostel, or small unendowed collede in\n   Oxford or Cambridge.'),
(36403, 'Hostelry', 'n.', 'An inn; a lodging house.'),
(36404, 'Hostess', 'n.', 'A female host; a woman who hospitably entertains guests at\n   her house.'),
(36405, 'Hostess', 'n.', 'A woman who entertains guests for compensation; a female\n   innkeeper.'),
(36406, 'Hostie', 'n.', 'The consecrated wafer; the host.'),
(36407, 'Hostile', 'a.', 'Belonging or appropriate to an enemy; showing the\n   disposition of an enemy; showing ill will and malevolence, or a desire\n   to thwart and injure; occupied by an enemy or enemies; inimical;\n   unfriendly; as, a hostile force; hostile intentions; a hostile country;\n   hostile to a sudden change.'),
(36408, 'Hostile', 'n.', 'An enemy; esp., an American Indian in arms against the\n   whites; -- commonly in the plural.'),
(36409, 'Hosting', 'n.', 'An encounter; a battle.'),
(36410, 'Hosting', 'n.', 'A muster or review.'),
(36411, 'Hostler', 'n.', 'An innkeeper. [Obs.] See Hosteler.'),
(36412, 'Hostler', 'n.', 'The person who has the care of horses at an inn or stable;\n   hence, any one who takes care of horses; a groom; -- so called because\n   the innkeeper formerly attended to this duty in person.'),
(36413, 'Hostler', 'n.', 'The person who takes charge of a locomotive when it is\n   left by the engineer after a trip.'),
(36414, 'Hostless', 'a.', 'Inhospitable.'),
(36415, 'Hostry', 'n.', 'A hostelry; an inn or lodging house.'),
(36416, 'Hostry', 'n.', 'A stable for horses.'),
(36417, 'Hotbed', 'n.', 'A bed of earth heated by fermenting manure or other\n   substances, and covered with glass, intended for raising early plants,\n   or for nourishing exotics.'),
(36418, 'Hotbed', 'n.', 'A place which favors rapid growth or development; as, a\n   hotbed of sedition.'),
(36419, 'Hotchpot', 'n.', 'Alt. of Hotchpotch'),
(36420, 'Hatte', 'pres. & imp.', 'of Hote'),
(36421, 'Hoten', '', 'of Hote'),
(36422, 'Hotel', 'n.', 'A house for entertaining strangers or travelers; an inn or\n   public house, of the better class.'),
(36423, 'Hotel', 'n.', 'In France, the mansion or town residence of a person of rank\n   or wealth.'),
(36424, 'Hoten', '', 'p. p. of Hote.'),
(36425, 'Hotfoot', 'adv.', 'In haste; foothot.'),
(36426, 'Hot-head', 'n.', 'A violent, passionate person; a hasty or impetuous\n   person; as, the rant of a hot-head.'),
(36427, 'Hothouse', 'n.', 'A house kept warm to shelter tender plants and shrubs\n   from the cold air; a place in which the plants of warmer climates may\n   be reared, and fruits ripened.'),
(36428, 'Hothouse', 'n.', 'A bagnio, or bathing house.'),
(36429, 'Hothouse', 'n.', 'A brothel; a bagnio.'),
(36430, 'Hothouse', 'n.', 'A heated room for drying green ware.'),
(36431, 'Hotly', 'a.', 'In a hot or fiery manner; ardently; vehemently; violently;\n   hastily; as, a hotly pursued.'),
(36432, 'Hotly', 'a.', 'In a lustful manner; lustfully.'),
(36433, 'Hotness', 'n.', 'The quality or state of being hot.'),
(36434, 'Hotness', 'n.', 'Heat or excitement of mind or manner; violence; vehemence;\n   impetuousity; ardor; fury.'),
(36435, 'Hotpress', 'v. t.', 'To apply to, in conjunction with mechanical pressure,\n   for the purpose of giving a smooth and glosay surface, or to express\n   oil, etc.; as, to hotpress paper, linen, etc.'),
(36436, 'Hotspur', 'n.', 'A rash, hot-headed man.'),
(36437, 'Hotspur', 'a.', 'Alt. of Hotspurred'),
(36438, 'Houdah', 'n.', 'See Howdah.'),
(36439, 'Hough', 'n.', 'Same as Hock, a joint.'),
(36440, 'Houghed', 'imp. & p. p.', 'of Hough'),
(36441, 'Houghing', 'p. pr. & vb. n.', 'of Hough'),
(36442, 'Hough', 'v. t.', 'Same as Hock, to hamstring.'),
(36443, 'Hough', 'n.', 'An adz; a hoe.'),
(36444, 'Hough', 'v. t.', 'To cut with a hoe.'),
(36445, 'Houlet', 'n.', 'An owl. See Howlet.'),
(36446, 'Hoult', 'n.', 'A piece of woodland; a small wood. [Obs.] See Holt.'),
(36447, 'Hound', 'n.', 'A variety of the domestic dog, usually having large,\n   drooping ears, esp. one which hunts game by scent, as the foxhound,\n   bloodhound, deerhound, but also used for various breeds of fleet\n   hunting dogs, as the greyhound, boarhound, etc.'),
(36448, 'Hound', 'n.', 'A despicable person.'),
(36449, 'Hound', 'n.', 'A houndfish.'),
(36450, 'Hound', 'n.', 'Projections at the masthead, serving as a support for the\n   trestletrees and top to rest on.'),
(36451, 'Hound', 'n.', 'A side bar used to strengthen portions of the running gear\n   of a vehicle.'),
(36452, 'Hounded', 'imp. & p. p.', 'of Hound'),
(36453, 'Hounding', 'p. pr. & vb. n.', 'of Hound'),
(36454, 'Hound', 'v. t.', 'To set on the chase; to incite to pursuit; as, to hounda\n   dog at a hare; to hound on pursuers.'),
(36455, 'Hound', 'v. t.', 'To hunt or chase with hounds, or as with hounds.'),
(36456, 'Hounding', 'n.', 'The act of one who hounds.'),
(36457, 'Hounding', 'n.', 'The part of a mast below the hounds and above the deck.'),
(36458, 'Houris', 'pl. ', 'of Houri'),
(36459, 'Houri', 'n.', 'A nymph of paradise; -- so called by the Mohammedans.'),
(36460, 'Hourly', 'a.', 'Happening or done every hour; occurring hour by hour;\n   frequent; often repeated; renewed hour by hour; continual.'),
(36461, 'Hourly', 'adv.', 'Every hour; frequently; continually.'),
(36462, 'Hours', 'n. pl.', 'Goddess of the seasons, or of the hours of the day.'),
(36463, 'Housage', 'n.', 'A fee for keeping goods in a house.'),
(36464, 'Houses', 'pl. ', 'of House'),
(36465, 'House', 'n.', 'A structure intended or used as a habitation or shelter for\n   animals of any kind; but especially, a building or edifice for the\n   habitation of man; a dwelling place, a mansion.'),
(36466, 'House', 'n.', 'Household affairs; domestic concerns; particularly in the\n   phrase to keep house. See below.'),
(36467, 'House', 'n.', 'Those who dwell in the same house; a household.'),
(36468, 'House', 'n.', 'A family of ancestors, descendants, and kindred; a race of\n   persons from the same stock; a tribe; especially, a noble family or an\n   illustrious race; as, the house of Austria; the house of Hanover; the\n   house of Israel.'),
(36469, 'House', 'n.', 'One of the estates of a kingdom or other government\n   assembled in parliament or legislature; a body of men united in a\n   legislative capacity; as, the House of Lords; the House of Commons; the\n   House of Representatives; also, a quorum of such a body. See Congress,\n   and Parliament.'),
(36470, 'House', 'n.', 'A firm, or commercial establishment.'),
(36471, 'House', 'n.', 'A public house; an inn; a hotel.'),
(36472, 'House', 'n.', 'A twelfth part of the heavens, as divided by six circles\n   intersecting at the north and south points of the horizon, used by\n   astrologers in noting the positions of the heavenly bodies, and casting\n   horoscopes or nativities. The houses were regarded as fixed in respect\n   to the horizon, and numbered from the one at the eastern horizon,\n   called the ascendant, first house, or house of life, downward, or in\n   the direction of the earth\'s revolution, the stars and planets passing\n   through them in the reverse order every twenty-four hours.'),
(36473, 'House', 'n.', 'A square on a chessboard, regarded as the proper place of a\n   piece.'),
(36474, 'House', 'n.', 'An audience; an assembly of hearers, as at a lecture, a\n   theater, etc.; as, a thin or a full house.'),
(36475, 'House', 'n.', 'The body, as the habitation of the soul.'),
(36476, 'House', 'n.', 'The grave.'),
(36477, 'Housed', 'imp. & p. p.', 'of House'),
(36478, 'Housing', 'p. pr. & vb. n.', 'of House'),
(36479, 'House', 'v. t.', 'To take or put into a house; to shelter under a roof; to\n   cover from the inclemencies of the weather; to protect by covering; as,\n   to house one\'s family in a comfortable home; to house farming utensils;\n   to house cattle.'),
(36480, 'House', 'v. t.', 'To drive to a shelter.'),
(36481, 'House', 'v. t.', 'To admit to residence; to harbor.'),
(36482, 'House', 'v. t.', 'To deposit and cover, as in the grave.'),
(36483, 'House', 'v. t.', 'To stow in a safe place; to take down and make safe; as,\n   to house the upper spars.'),
(36484, 'House', 'v. i.', 'To take shelter or lodging; to abide to dwell; to lodge.'),
(36485, 'House', 'v. i.', 'To have a position in one of the houses. See House, n.,\n   8.'),
(36486, 'Housel', 'n.', 'The eucharist.'),
(36487, 'Housel', 'v. t.', 'To administer the eucharist to.'),
(36488, 'Housing', 'n.', 'The act of putting or receiving under shelter; the state\n   of dwelling in a habitation.'),
(36489, 'Housing', 'n.', 'That which shelters or covers; houses, taken collectively.'),
(36490, 'Housing', 'n.', 'The space taken out of one solid, to admit the insertion\n   of part of another, as the end of one timber in the side of another.'),
(36491, 'Housing', 'n.', 'A niche for a statue.'),
(36492, 'Housing', 'n.', 'A frame or support for holding something in place, as\n   journal boxes, etc.'),
(36493, 'Housing', 'n.', 'That portion of a mast or bowsprit which is beneath the\n   deck or within the vessel.'),
(36494, 'Housing', 'n.', 'A covering or protection, as an awning over the deck of a\n   ship when laid up.'),
(36495, 'Housing', 'n.', 'A houseline. See Houseline.'),
(36496, 'Housing', 'n.', 'A cover or cloth for a horse\'s saddle, as an ornamental or\n   military appendage; a saddlecloth; a horse cloth; in plural, trappings.'),
(36497, 'Housing', 'n.', 'An appendage to the hames or collar of a harness.'),
(36498, 'Housling', 'a.', 'Sacramental; as, housling fire.'),
(36499, 'Houss', 'n.', 'A saddlecloth; a housing.'),
(36500, 'Houtou', 'n.', 'A beautiful South American motmot.'),
(36501, 'Houve', 'n.', 'A head covering of various kinds; a hood; a coif; a cap.'),
(36502, 'Hovel', 'n.', 'An open shed for sheltering cattle, or protecting produce,\n   etc., from the weather.'),
(36503, 'Hovel', 'n.', 'A poor cottage; a small, mean house; a hut.'),
(36504, 'Hovel', 'n.', 'A large conical brick structure around which the firing\n   kilns are grouped.'),
(36505, 'Hoveled', 'imp. & p. p.', 'of Hovel'),
(36506, 'Hovelled', '', 'of Hovel'),
(36507, 'Hoveling', 'p. pr. & vb. n.', 'of Hovel'),
(36508, 'Hovel', 'v. t.', 'To put in a hovel; to shelter.'),
(36509, 'Hoveler', 'n.', 'One who assists in saving life and property from a wreck;\n   a coast boatman.'),
(36510, 'Hoveling', 'n.', 'A method of securing a good draught in chimneys by\n   covering the top, leaving openings in the sides, or by carrying up two\n   of the sides higher than the other two.'),
(36511, 'Hoven', '', 'p. p. of Heave.'),
(36512, 'Hoven', 'a.', 'Affected with the disease called hoove; as, hoven cattle.'),
(36513, 'Hover', 'n.', 'A cover; a shelter; a protection.'),
(36514, 'Hovered', 'imp. & p. p.', 'of Hover'),
(36515, 'Hovering', 'p. pr. & vb. n.', 'of Hover'),
(36516, 'Hover', 'v. i.', 'To hang fluttering in the air, or on the wing; to remain\n   in flight or floating about or over a place or object; to be suspended\n   in the air above something.'),
(36517, 'Hover', 'v. i.', 'To hang about; to move to and fro near a place,\n   threateningly, watchfully, or irresolutely.'),
(36518, 'Hoverer', 'n.', 'A device in an incubator for protecting the young chickens\n   and keeping them warm.'),
(36519, 'Howadji', 'n.', 'A traveler.'),
(36520, 'Howadji', 'n.', 'A merchant; -- so called in the East because merchants\n   were formerly the chief travelers.'),
(36521, 'Howbeit', 'conj.', 'Be it as it may; nevertheless; notwithstanding;\n   although; albeit; yet; but; however.'),
(36522, 'Howdah', 'n.', 'A seat or pavilion, generally covered, fastened on the back\n   of an elephant, for the rider or riders.'),
(36523, 'Howdy', 'n.', 'A midwife.'),
(36524, 'Howel', 'n.', 'A tool used by coopers for smoothing and chamfering rheir\n   work, especially the inside of casks.'),
(36525, 'Howel', 'v. t.', 'To smooth; to plane; as, to howel a cask.'),
(36526, 'Howell', 'n.', 'The upper stage of a porcelian furnace.'),
(36527, 'However', 'adv.', 'In whetever manner, way, or degree.'),
(36528, 'However', 'adv.', 'At all events; at least; in any case.'),
(36529, 'However', 'conj.', 'Nevertheless; notwithstanding; yet; still; though; as,\n   I shall not oppose your design; I can not, however, approve of it.'),
(36530, 'Howitz', 'n.', 'A howitzer.'),
(36531, 'Howitzer', 'n.', 'A gun so short that the projectile, which was hollow,\n   could be put in its place by hand; a kind of mortar.'),
(36532, 'Howitzer', 'n.', 'A short, light, largebore cannon, usually having a\n   chamber of smaller diameter than the rest of the bore, and intended to\n   throw large projectiles with comparatively small charges.'),
(36533, 'Howker', 'n.', 'Same as Hooker.'),
(36534, 'Howled', 'imp. & p. p.', 'of Howl'),
(36535, 'Howling', 'p. pr. & vb. n.', 'of Howl'),
(36536, 'Howler', 'n.', 'One who howls.'),
(36537, 'Howler', 'n.', 'Any South American monkey of the genus Mycetes. Many\n   species are known. They are arboreal in their habits, and are noted for\n   the loud, discordant howling in which they indulge at night.'),
(36538, 'Howlet', 'n.', 'An owl; an owlet.'),
(36539, 'Howso', 'adv.', 'Howsoever.'),
(36540, 'Howve', 'n.', 'A hood. See Houve.'),
(36541, 'Hoyden', 'n.', 'Same as Hoiden.'),
(36542, 'Hoymen', 'pl. ', 'of Hoyman'),
(36543, 'Hoyman', 'n.', 'One who navigates a hoy.'),
(36544, 'Huanaco', 'n.', 'See Guanaco.'),
(36545, 'Hubbub', 'v. i.', 'A loud noise of many confused voices; a tumult; uproar.'),
(36546, 'Hubby', 'a.', 'Full of hubs or protuberances; as, a road that has been\n   frozen while muddy is hubby.'),
(36547, 'Hubner', 'n.', 'A mineral of brownish black color, occurring in columnar or\n   foliated masses. It is native manganese tungstate.'),
(36548, 'Huchen', 'n.', 'A large salmon (Salmo, / Salvelinus, hucho) inhabiting the\n   Danube; -- called also huso, and bull trout.'),
(36549, 'Huckle', 'n.', 'The hip; the haunch.'),
(36550, 'Huckle', 'n.', 'A bunch or part projecting like the hip.'),
(36551, 'Huckster', 'n.', 'A retailer of small articles, of provisions, and the\n   like; a peddler; a hawker.'),
(36552, 'Huckster', 'n.', 'A mean, trickish fellow.'),
(36553, 'Huckster', 'v. i.', 'To deal in small articles, or in petty bargains.'),
(36554, 'Huddled', 'imp. & p. p.', 'of Huddle'),
(36555, 'Huddling', 'p. pr. & vb. n.', 'of Huddle'),
(36556, 'Huddle', 'v. i.', 'To press together promiscuously, from confusion,\n   apprehension, or the like; to crowd together confusedly; to press or\n   hurry in disorder; to crowd.'),
(36557, 'Huddle', 'v. t.', 'To crowd (things) together to mingle confusedly; to\n   assemble without order or system.'),
(36558, 'Huddle', 'v. t.', 'To do, make, or put, in haste or roughly; hence, to do\n   imperfectly; -- usually with a following preposition or adverb; as, to\n   huddle on; to huddle up; to huddle together.'),
(36559, 'Huddle', 'n.', 'A crowd; a number of persons or things crowded together in\n   a confused manner; tumult; confusion.'),
(36560, 'Huddler', 'n.', 'One who huddles things together.'),
(36561, 'Hudge', 'n.', 'An iron bucket for hoisting coal or ore.'),
(36562, 'Hueless', 'a.', 'Destitute of color.'),
(36563, 'Huffed', 'imp. & p. p.', 'of Huff'),
(36564, 'Huffing', 'p. pr. & vb. n.', 'of Huff'),
(36565, 'Huffcap', 'n.', 'A blusterer; a bully.'),
(36566, 'Huffcap', 'a.', 'Blustering; swaggering.'),
(36567, 'Huffer', 'n.', 'A bully; a blusterer.'),
(36568, 'Huffish', 'a.', 'Disposed to be blustering or arrogant; petulant.'),
(36569, 'Huffy', 'a.', 'Puffed up; as, huffy bread.'),
(36570, 'Huffy', 'a.', 'Characterized by arrogance or petulance; easily offended.'),
(36571, 'Hugged', 'imp. & p. p.', 'of Hug'),
(36572, 'Hugging', 'p. pr. & vb. n.', 'of Hug'),
(36573, 'Hugger', 'n.', 'One who hugs or embraces.'),
(36574, 'Hugger', 'v. t. & i.', 'To conceal; to lurk ambush.'),
(36575, 'Huggle', 'v. t.', 'To hug.'),
(36576, 'Huguenot', 'n.', 'A French Protestant of the period of the religious wars\n   in France in the 16th century.'),
(36577, 'Huisher', 'n.', 'See Usher.'),
(36578, 'Huisher', 'v. t.', 'To usher.'),
(36579, 'Hulan', 'n.', 'See Uhlan.'),
(36580, 'Hulch', 'n.', 'A hunch.'),
(36581, 'Hulchy', 'a.', 'Swollen; gibbous.'),
(36582, 'Hulking', 'a.', 'Alt. of Hulky'),
(36583, 'Hulky', 'a.', 'Bulky; unwiedly.'),
(36584, 'Hulled', 'imp. & p. p.', 'of Hull'),
(36585, 'Hulling', 'p. pr. & vb. n.', 'of Hull'),
(36586, 'Hulled', 'a.', 'Deprived of the hulls.'),
(36587, 'Huller', 'n.', 'One who, or that which, hulls; especially, an agricultural\n   machine for removing the hulls from grain; a hulling machine.'),
(36588, 'Hullo', 'interj.', 'See Hollo.'),
(36589, 'Hully', 'a.', 'Having or containing hulls.'),
(36590, 'Huloist', 'n.', 'See Hyloist.'),
(36591, 'Hulver', 'n.', 'Holly, an evergreen shrub or tree.'),
(36592, 'Hummed', 'imp. & p. p.', 'of Hum'),
(36593, 'Humming', 'p. pr. & vb. n.', 'of Hum'),
(36594, 'Human', 'a.', 'Belonging to man or mankind; having the qualities or\n   attributes of a man; of or pertaining to man or to the race of man; as,\n   a human voice; human shape; human nature; human sacrifices.'),
(36595, 'Human', 'n.', 'A human being.'),
(36596, 'Humanate', 'a.', 'Indued with humanity.'),
(36597, 'Humane', 'a.', 'Pertaining to man; human.'),
(36598, 'Humane', 'a.', 'Having the feelings and inclinations creditable to man;\n   having a disposition to treat other human beings or animals with\n   kindness; kind; benevolent.'),
(36599, 'Humane', 'a.', 'Humanizing; exalting; tending to refine.'),
(36600, 'Humanics', 'n.', 'The study of human nature.'),
(36601, 'Humanify', 'v. t.', 'To make human; to invest with a human personality; to\n   incarnate.'),
(36602, 'Humanism', 'n.', 'Human nature or disposition; humanity.'),
(36603, 'Humanism', 'n.', 'The study of the humanities; polite learning.'),
(36604, 'Humanist', 'n.', 'One of the scholars who in the field of literature proper\n   represented the movement of the Renaissance, and early in the 16th\n   century adopted the name Humanist as their distinctive title.'),
(36605, 'Humanist', 'n.', 'One who purposes the study of the humanities, or polite\n   literature.'),
(36606, 'Humanist', 'n.', 'One versed in knowledge of human nature.'),
(36607, 'Humanity', 'n.', 'The quality of being human; the peculiar nature of man,\n   by which he is distinguished from other beings.'),
(36608, 'Humanity', 'n.', 'Mankind collectively; the human race.'),
(36609, 'Humanity', 'n.', 'The quality of being humane; the kind feelings,\n   dispositions, and sympathies of man; especially, a disposition to\n   relieve persons or animals in distress, and to treat all creatures with\n   kindness and tenderness.'),
(36610, 'Humanity', 'n.', 'Mental cultivation; liberal education; instruction in\n   classical and polite literature.'),
(36611, 'Humanity', 'n.', 'The branches of polite or elegant learning; as language,\n   rhetoric, poetry, and the ancient classics; belles-letters.'),
(36612, 'Humanize', 'v. t.', 'To render human or humane; to soften; to make gentle\n   by overcoming cruel dispositions and rude habits; to refine or\n   civilize.'),
(36613, 'Humanize', 'v. t.', 'To give a human character or expression to.'),
(36614, 'Humanize', 'v. t.', 'To convert into something human or belonging to man;\n   as, to humanize vaccine lymph.'),
(36615, 'Humanize', 'v. i.', 'To become or be made more humane; to become civilized;\n   to be ameliorated.'),
(36616, 'Humanly', 'adv.', 'In a human manner; after the manner of men; according to\n   the knowledge or wisdom of men; as, the present prospects, humanly\n   speaking, promise a happy issue.'),
(36617, 'Humanly', 'adv.', 'Kindly; humanely.'),
(36618, 'Humate', 'n.', 'A salt of humic acid.'),
(36619, 'Humation', 'n.', 'Interment; inhumation.'),
(36620, 'Humbird', 'n.', 'Humming bird.'),
(36621, 'Humble', 'superl.', 'Near the ground; not high or lofty; not pretentious or\n   magnificent; unpretending; unassuming; as, a humble cottage.'),
(36622, 'Humble', 'superl.', 'Thinking lowly of one\'s self; claiming little for\n   one\'s self; not proud, arrogant, or assuming; thinking one\'s self\n   ill-deserving or unworthy, when judged by the demands of God; lowly;\n   waek; modest.'),
(36623, 'Humble', 'a.', 'Hornless. See Hummel.'),
(36624, 'Humbled', 'imp. & p. p.', 'of Humble'),
(36625, 'Humbling', 'p. pr. & vb. n.', 'of Humble'),
(36626, 'Humble', 'v. t.', 'To bring low; to reduce the power, independence, or\n   exaltation of; to lower; to abase; to humilate.'),
(36627, 'Humble', 'v. t.', 'To make humble or lowly in mind; to abase the pride or\n   arrogance of; to reduce the self-sufficiently of; to make meek and\n   submissive; -- often used rexlexively.'),
(36628, 'Humbler', 'n.', 'One who, or that which, humbles some one.'),
(36629, 'Humbles', 'n. pl.', 'Entrails of a deer.'),
(36630, 'Humbly', 'adv.', 'With humility; lowly.'),
(36631, 'Humbug', 'n.', 'An imposition under fair pretenses; something contrived in\n   order to deceive and mislead; a trick by cajolery; a hoax.'),
(36632, 'Humbug', 'n.', 'A spirit of deception; cajolery; trickishness.'),
(36633, 'Humbug', 'n.', 'One who deceives or misleads; a deceitful or trickish\n   fellow; an impostor.'),
(36634, 'Humbug', 'v. t.', 'To deceive; to impose; to cajole; to hoax.'),
(36635, 'Humdrum', 'a.', 'Monotonous; dull; commonplace.'),
(36636, 'Humdrum', 'n.', 'A dull fellow; a bore.'),
(36637, 'Humdrum', 'n.', 'Monotonous and tedious routine.'),
(36638, 'Humdrum', 'n.', 'A low cart with three wheels, drawn by one horse.'),
(36639, 'Humect', 'v. t.', 'Alt. of Humectate'),
(36640, 'Humeral', 'a.', 'Of or pertaining to the humerus, or upper part of the arm;\n   brachial.'),
(36641, 'Humeri', 'pl. ', 'of Humerus'),
(36642, 'Humerus', 'n.', 'The bone of the brachium, or upper part of the arm or fore\n   limb.'),
(36643, 'Humerus', 'n.', 'The part of the limb containing the humerus; the brachium.'),
(36644, 'Humic', 'a.', 'Pertaining to, or derived from, vegetable mold; as, humic\n   acid. See Humin.'),
(36645, 'Humid', 'a.', 'Containing sensible moisture; damp; moist; as, a humidair or\n   atmosphere; somewhat wet or watery; as, humid earth; consisting of\n   water or vapor.'),
(36646, 'Humidity', 'n.', 'Moisture; dampness; a moderate degree of wetness, which\n   is perceptible to the eye or touch; -- used especially of the\n   atmosphere, or of anything which has absorbed moisture from the\n   atmosphere, as clothing.'),
(36647, 'Humifuse', 'a.', 'Spread over the surface of the ground; procumbent.'),
(36648, 'Humility', 'n.', 'The state or quality of being humble; freedom from pride\n   and arrogance; lowliness of mind; a modest estimate of one\'s own worth;\n   a sense of one\'s own unworthiness through imperfection and sinfulness;\n   self-abasement; humbleness.'),
(36649, 'Humility', 'n.', 'An act of submission or courtesy.'),
(36650, 'Humin', 'n.', 'A bitter, brownish yellow, amorphous substance, extracted\n   from vegetable mold, and also produced by the action of acids on\n   certain sugars and carbohydrates; -- called also humic acid, ulmin,\n   gein, ulmic or geic acid, etc.'),
(36651, 'Humiri', 'n.', 'A fragrant balsam obtained from Brazilian trees of the\n   genus Humirium.'),
(36652, 'Humite', 'n.', 'A mineral of a transparent vitreous brown color, found in\n   the ejected masses of Vesuvius. It is a silicate of iron and magnesia,\n   containing fluorine.'),
(36653, 'Hummel', 'v. t.', 'To separate from the awns; -- said of barley.'),
(36654, 'Hummel', 'a.', 'Having no awns or no horns; as, hummelcorn; a hummel cow.'),
(36655, 'Hummeler', 'n.', 'One who, or a machine which, hummels.'),
(36656, 'Hummer', 'n.', 'One who, or that which, hums; one who applauds by humming.'),
(36657, 'Hummer', 'n.', 'A humming bird.'),
(36658, 'Humming', 'a.', 'Emitting a murmuring sound; droning; murmuring; buzzing.'),
(36659, 'Humming', 'n.', 'A sound like that made by bees; a low, murmuring sound; a\n   hum.'),
(36660, 'Hummock', 'n.', 'A rounded knoll or hillock; a rise of ground of no great\n   extent, above a level surface.'),
(36661, 'Hummock', 'n.', 'A ridge or pile of ice on an ice field.'),
(36662, 'Hummock', 'n.', 'Timbered land. See Hammock.'),
(36663, 'Hummocky', 'a.', 'Abounding in hummocks.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(36664, 'Hummum', 'n.', 'A sweating bath or place for sweating.'),
(36665, 'Humor', 'n.', 'Moisture, especially, the moisture or fluid of animal\n   bodies, as the chyle, lymph, etc.; as, the humors of the eye, etc.'),
(36666, 'Humor', 'n.', 'A vitiated or morbid animal fluid, such as often causes an\n   eruption on the skin.'),
(36667, 'Humor', 'n.', 'State of mind, whether habitual or temporary (as formerly\n   supposed to depend on the character or combination of the fluids of the\n   body); disposition; temper; mood; as, good humor; ill humor.'),
(36668, 'Humor', 'n.', 'Changing and uncertain states of mind; caprices; freaks;\n   vagaries; whims.'),
(36669, 'Humor', 'n.', 'That quality of the imagination which gives to ideas an\n   incongruous or fantastic turn, and tends to excite laughter or mirth by\n   ludicrous images or representations; a playful fancy; facetiousness.'),
(36670, 'Humored', 'imp. & p. p.', 'of Humor'),
(36671, 'Humoring', 'p. pr. & vb. n.', 'of Humor'),
(36672, 'Humor', 'v. t.', 'To comply with the humor of; to adjust matters so as suit\n   the peculiarities, caprices, or exigencies of; to adapt one\'s self to;\n   to indulge by skillful adaptation; as, to humor the mind.'),
(36673, 'Humor', 'v. t.', 'To help on by indulgence or compliant treatment; to\n   soothe; to gratify; to please.'),
(36674, 'Humoral', 'a.', 'Pertaining to, or proceeding from, the humors; as, a\n   humoral fever.'),
(36675, 'Humorism', 'n.', 'The theory founded on the influence which the humors were\n   supposed to have in the production of disease; Galenism.'),
(36676, 'Humorism', 'n.', 'The manner or disposition of a humorist; humorousness.'),
(36677, 'Humorist', 'n.', 'One who attributes diseases of the state of the humors.'),
(36678, 'Humorist', 'n.', 'One who has some peculiarity or eccentricity of\n   character, which he indulges in odd or whimsical ways.'),
(36679, 'Humorist', 'n.', 'One who displays humor in speaking or writing; one who\n   has a facetious fancy or genius; a wag; a droll.'),
(36680, 'Humorize', 'v. t.', 'To humor.'),
(36681, 'Humorous', 'a.', 'Moist; humid; watery.'),
(36682, 'Humorous', 'a.', 'Subject to be governed by humor or caprice; irregular;\n   capricious; whimsical.'),
(36683, 'Humorous', 'a.', 'Full of humor; jocular; exciting laughter; playful; as, a\n   humorous story or author; a humorous aspect.'),
(36684, 'Humpback', 'n.', 'A crooked back; a humped back.'),
(36685, 'Humpback', 'n.', 'A humpbacked person; a hunchback.'),
(36686, 'Humpback', 'n.', 'Any whale of the genus Megaptera, characterized by a hump\n   or bunch on the back. Several species are known. The most common ones\n   in the North Atlantic are Megaptera longimana of Europe, and M. osphyia\n   of America; that of the California coasts is M. versabilis.'),
(36687, 'Humpback', 'n.', 'A small salmon (Oncorhynchus gorbuscha), of the northwest\n   coast of America.'),
(36688, 'Humped', 'a.', 'Having a hump, as the back.'),
(36689, 'Humph', 'interj.', 'An exclamation denoting surprise, or contempt, doubt,\n   etc.'),
(36690, 'Humpless', 'a.', 'Without a hump.'),
(36691, 'Humpy', 'a.', 'Full of humps or bunches; covered with protuberances;\n   humped.'),
(36692, 'Humstrum', 'n.', 'An instrument out of tune or rudely constructed; music\n   badly played.'),
(36693, 'Humulin', 'n.', 'An extract of hops.'),
(36694, 'Humus', 'n.', 'That portion of the soil formed by the decomposition of\n   animal or vegetable matter. It is a valuable constituent of soils.'),
(36695, 'Hunch', 'n.', 'A hump; a protuberance.'),
(36696, 'Hunch', 'n.', 'A lump; a thick piece; as, a hunch of bread.'),
(36697, 'Hunch', 'n.', 'A push or thrust, as with the elbow.'),
(36698, 'Hunched', 'imp. & p. p.', 'of Hunch'),
(36699, 'Hunching', 'p. pr. & vb. n.', 'of Hunch'),
(36700, 'Hunch', 'v. t.', 'To push or jostle with the elbow; to push or thrust\n   suddenly.'),
(36701, 'Hunch', 'v. t.', 'To thrust out a hump or protuberance; to crook, as the\n   back.'),
(36702, 'Hundred', 'n.', 'The product of ten mulitplied by ten, or the number of ten\n   times ten; a collection or sum, consisting of ten times ten units or\n   objects; five score. Also, a symbol representing one hundred units, as\n   100 or C.'),
(36703, 'Hundred', 'n.', 'A division of a country in England, supposed to have\n   originally contained a hundred families, or freemen.'),
(36704, 'Hundred', 'a.', 'Ten times ten; five score; as, a hundred dollars.'),
(36705, 'Hungary', 'n.', 'A country in Central Europe, now a part of the\n   Austro-Hungarian Empire.'),
(36706, 'Hunger', 'n.', 'An uneasy sensation occasioned normally by the want of\n   food; a craving or desire for food.'),
(36707, 'Hunger', 'n.', 'Any strong eager desire.'),
(36708, 'Hungered', 'imp. & p. p.', 'of Hunger'),
(36709, 'Hunger', 'n.', 'To feel the craving or uneasiness occasioned by want of\n   food; to be oppressed by hunger.'),
(36710, 'Hunger', 'n.', 'To have an eager desire; to long.'),
(36711, 'Hunger', 'v. t.', 'To make hungry; to famish.'),
(36712, 'Hungered', 'a.', 'Hungry; pinched for food.'),
(36713, 'Hungerer', 'n.', 'One who hungers; one who longs.'),
(36714, 'Hungerly', 'a.', 'Wanting food; starved.'),
(36715, 'Hungerly', 'adv.', 'With keen appetite.'),
(36716, 'Hungred', 'a.', 'Hungered; hungry.'),
(36717, 'Hungrily', 'adv.', 'In a hungry manner; voraciously.'),
(36718, 'Hungry', 'superl.', 'Feeling hunger; having a keen appetite; feeling\n   uneasiness or distress from want of food; hence, having an eager\n   desire.'),
(36719, 'Hungry', 'superl.', 'Showing hunger or a craving desire; voracious.'),
(36720, 'Hungry', 'superl.', 'Not rich or fertile; poor; barren; starved; as, a\n   hungry soil.'),
(36721, 'Hunker', 'n.', 'Originally, a nickname for a member of the conservative\n   section of the Democratic party in New York; hence, one opposed to\n   progress in general; a fogy.'),
(36722, 'Hunks', 'n.', 'A covetous, sordid man; a miser; a niggard.'),
(36723, 'Hunted', 'imp. & p. p.', 'of Hunt'),
(36724, 'Hunting', 'p. pr. & vb. n.', 'of Hunt'),
(36725, 'Hunte', 'n.', 'A hunter.'),
(36726, 'Hunter', 'n.', 'One who hunts wild animals either for sport or for food; a\n   huntsman.'),
(36727, 'Hunter', 'n.', 'A dog that scents game, or is trained to the chase; a\n   hunting dog.'),
(36728, 'Hunter', 'n.', 'A horse used in the chase; especially, a thoroughbred, bred\n   and trained for hunting.'),
(36729, 'Hunter', 'n.', 'One who hunts or seeks after anything, as if for game; as,\n   a fortune hunter a place hunter.'),
(36730, 'Hunter', 'n.', 'A kind of spider. See Hunting spider, under Hunting.'),
(36731, 'Hunter', 'n.', 'A hunting watch, or one of which the crystal is protected\n   by a metallic cover.'),
(36732, 'Hunting', 'n.', 'The pursuit of game or of wild animals.'),
(36733, 'Huntress', 'n.', 'A woman who hunts or follows the chase; as, the huntress\n   Diana.'),
(36734, 'Huntsmen', 'pl. ', 'of Huntsman'),
(36735, 'Huntsman', 'n.', 'One who hunts, or who practices hunting.'),
(36736, 'Huntsman', 'n.', 'The person whose office it is to manage the chase or to\n   look after the hounds.'),
(36737, 'Hunts-up', 'n.', 'A tune played on the horn very early in the morning to\n   call out the hunters; hence, any arousing sound or call.'),
(36738, 'Hurden', 'n.', 'A coarse kind of linen; -- called also harden.'),
(36739, 'Hurdle', 'n.', 'A movable frame of wattled twigs, osiers, or withes and\n   stakes, or sometimes of iron, used for inclosing land, for folding\n   sheep and cattle, for gates, etc.; also, in fortification, used as\n   revetments, and for other purposes.'),
(36740, 'Hurdle', 'n.', 'In England, a sled or crate on which criminals were\n   formerly drawn to the place of execution.'),
(36741, 'Hurdle', 'n.', 'An artificial barrier, variously constructed, over which\n   men or horses leap in a race.'),
(36742, 'Hurdleed', 'imp. & p. p.', 'of Hurdle'),
(36743, 'Hurdle', 'v. t.', 'To hedge, cover, make, or inclose with hurdles.'),
(36744, 'Hurds', 'n.', 'The coarse part of flax or hemp; hards.'),
(36745, 'Hurkaru', 'n.', 'In India, a running footman; a messenger.'),
(36746, 'Hurled', 'imp. & p. p.', 'of Hurl'),
(36747, 'Hurling', 'p. pr. & vb. n.', 'of Hurl'),
(36748, 'Hurlbat', 'n.', 'See Whirlbat.'),
(36749, 'Hurlbone', 'n.', 'See Whirlbone.'),
(36750, 'Hurlbone', 'n.', 'A bone near the middle of the buttock of a horse.'),
(36751, 'Hurler', 'n.', 'One who hurls, or plays at hurling.'),
(36752, 'Hurling', 'n.', 'The act of throwing with force.'),
(36753, 'Hurling', 'n.', 'A kind of game at ball, formerly played.'),
(36754, 'Hurlwind', 'n.', 'A whirlwind.'),
(36755, 'Hurly', 'n.', 'Noise; confusion; uproar.'),
(36756, 'Huronian', 'a.', 'Of or pertaining to certain non-fossiliferous rocks on\n   the borders of Lake Huron, which are supposed to correspond in time to\n   the latter part of the Archaean age.'),
(36757, 'Hurons', 'n. pl.', '; sing. Huron. (Ethnol.) A powerful and warlike tribe\n   of North American Indians of the Algonquin stock. They formerly\n   occupied the country between Lakes Huron, Erie, and Ontario, but were\n   nearly exterminated by the Five Nations about 1650.'),
(36758, 'Hurrah', 'interj.', 'Alt. of Hurra'),
(36759, 'Hurra', 'interj.', 'A word used as a shout of joy, triumph, applause,\n   encouragement, or welcome.'),
(36760, 'Hurrah', 'n.', 'A cheer; a shout of joy, etc.'),
(36761, 'Hurrah', 'v. i.', 'To utter hurrahs; to huzza.'),
(36762, 'Hurrah', 'v. t.', 'To salute, or applaud, with hurrahs.'),
(36763, 'Hurried', 'a.', 'Urged on; hastened; going or working at speed; as, a\n   hurried writer; a hurried life.'),
(36764, 'Hurried', 'a.', 'Done in a hurry; hence, imperfect; careless; as, a hurried\n   job.'),
(36765, 'Hurrier', 'n.', 'One who hurries or urges.'),
(36766, 'Hurries', 'n.', 'A staith or framework from which coal is discharged from\n   cars into vessels.'),
(36767, 'Hurried', 'imp. & p. p.', 'of Hurry'),
(36768, 'Hurrying', 'p. pr. & vb. n.', 'of Hurry'),
(36769, 'Hurry', 'v. t.', 'To hasten; to impel to greater speed; to urge on.'),
(36770, 'Hurry', 'v. t.', 'To impel to precipitate or thoughtless action; to urge to\n   confused or irregular activity.'),
(36771, 'Hurry', 'v. t.', 'To cause to be done quickly.'),
(36772, 'Hurry', 'v. i.', 'To move or act with haste; to proceed with celerity or\n   precipitation; as, let us hurry.'),
(36773, 'Hurry', 'n.', 'The act of hurrying in motion or business; pressure;\n   urgency; bustle; confusion.'),
(36774, 'Hurst', 'n.', 'A wood or grove; -- a word used in the composition of many\n   names, as in Hazlehurst.'),
(36775, 'Hurting', 'p. pr. & vb. n.', 'of Hurt'),
(36776, 'Hurter', 'n.', 'A bodily injury causing pain; a wound, bruise, or the like.'),
(36777, 'Hurter', 'n.', 'An injury causing pain of mind or conscience; a slight; a\n   stain; as of sin.'),
(36778, 'Hurter', 'n.', 'Injury; damage; detriment; harm; mischief.'),
(36779, 'Hurter', 'n.', 'One who hurts or does harm.'),
(36780, 'Hurter', 'v. t.', 'A butting piece; a strengthening piece, esp.: (Mil.) A\n   piece of wood at the lower end of a platform, designed to prevent the\n   wheels of gun carriages from injuring the parapet.'),
(36781, 'Hurtful', 'a.', 'Tending to impair or damage; injurious; mischievous;\n   occasioning loss or injury; as, hurtful words or conduct.'),
(36782, 'Hurtled', 'imp. & p. p.', 'of Hurtle'),
(36783, 'Hurtling', 'p. pr. & vb. n.', 'of Hurtle'),
(36784, 'Hurtle', 'v. t.', 'To meet with violence or shock; to clash; to jostle.'),
(36785, 'Hurtle', 'v. t.', 'To move rapidly; to wheel or rush suddenly or with\n   violence; to whirl round rapidly; to skirmish.'),
(36786, 'Hurtle', 'v. t.', 'To make a threatening sound, like the clash of arms; to\n   make a sound as of confused clashing or confusion; to resound.'),
(36787, 'Hurtle', 'v. t.', 'To move with violence or impetuosity; to whirl; to\n   brandish.'),
(36788, 'Hurtle', 'v. t.', 'To push; to jostle; to hurl.'),
(36789, 'Hurtless', 'a.', 'Doing no injury; harmless; also, unhurt; without injury\n   or harm.'),
(36790, 'Husband', 'n.', 'The male head of a household; one who orders the economy\n   of a family.'),
(36791, 'Husband', 'n.', 'A cultivator; a tiller; a husbandman.'),
(36792, 'Husband', 'n.', 'One who manages or directs with prudence and economy; a\n   frugal person; an economist.'),
(36793, 'Husband', 'n.', 'A married man; a man who has a wife; -- the correlative to\n   wife.'),
(36794, 'Husband', 'n.', 'The male of a pair of animals.'),
(36795, 'Husband', 'v. t.', 'To direct and manage with frugality; to use or employ\n   to good purpose and the best advantage; to spend, apply, or use, with\n   economy.'),
(36796, 'Husband', 'v. t.', 'To cultivate, as land; to till.'),
(36797, 'Husband', 'v. t.', 'To furnish with a husband.'),
(36798, 'Hushed', 'imp. & p. p.', 'of Hush'),
(36799, 'Hushing', 'p. pr. & vb. n.', 'of Hush'),
(36800, 'Husher', 'n.', 'An usher.'),
(36801, 'Hushing', 'n.', 'The process of washing ore, or of uncovering mineral\n   veins, by a heavy discharge of water from a reservoir; flushing; --\n   also called booming.'),
(36802, 'Husked', 'imp. & p. p.', 'of Husk'),
(36803, 'Husking', 'p. pr. & vb. n.', 'of Husk'),
(36804, 'Husked', 'a.', 'Covered with a husk.'),
(36805, 'Husked', 'a.', 'Stripped of husks; deprived of husks.'),
(36806, 'Huskily', 'adv.', 'In a husky manner; dryly.'),
(36807, 'Husking', 'n.', 'The act or process of stripping off husks, as from Indian\n   corn.'),
(36808, 'Husking', 'n.', 'A meeting of neighbors or friends to assist in husking\n   maize; -- called also'),
(36809, 'Husky', 'n.', 'Abounding with husks; consisting of husks.'),
(36810, 'Husky', 'a.', 'Rough in tone; harsh; hoarse; raucous; as, a husky voice.'),
(36811, 'Hussar', 'n.', 'Originally, one of the national cavalry of Hungary and\n   Croatia; now, one of the light cavalry of European armies.'),
(36812, 'Hussite', 'n.', 'A follower of John Huss, the Bohemian reformer, who was\n   adjudged a heretic and burnt alive in 1415.'),
(36813, 'Hussy', 'n.', 'A housewife or housekeeper.'),
(36814, 'Hussy', 'n.', 'A worthless woman or girl; a forward wench; a jade; -- used\n   as a term of contempt or reproach.'),
(36815, 'Hussy', 'n.', 'A pert girl; a frolicsome or sportive young woman; -- used\n   jocosely.'),
(36816, 'Hussy', 'n.', 'A case or bag. See Housewife, 2.'),
(36817, 'Hustings', 'n. pl.', 'A court formerly held in several cities of England;\n   specif., a court held in London, before the lord mayor, recorder, and\n   sheriffs, to determine certain classes of suits for the recovery of\n   lands within the city. In the progress of law reform this court has\n   become unimportant.'),
(36818, 'Hustings', 'n. pl.', 'Any one of the temporary courts held for the election\n   of members of the British Parliament.'),
(36819, 'Hustings', 'n. pl.', 'The platform on which candidates for Parliament\n   formerly stood in addressing the electors.'),
(36820, 'Hustled', 'imp. & p. p.', 'of Hustle'),
(36821, 'Hustling', 'p. pr. & vb. n.', 'of Hustle'),
(36822, 'Hustle', 'v. t.', 'To shake together in confusion; to push, jostle, or\n   crowd rudely; to handle roughly; as, to hustle a person out of a room.'),
(36823, 'Hustle', 'v. i.', 'To push or crows; to force one\'s way; to move hustily\n   and with confusion; a hurry.'),
(36824, 'Huswife', 'n.', 'A female housekeeper; a woman who manages domestic\n   affairs; a thirfty woman.'),
(36825, 'Huswife', 'n.', 'A worthless woman; a hussy.'),
(36826, 'Huswife', 'n.', 'A case for sewing materials. See Housewife.'),
(36827, 'Huswife', 'v. t.', 'To manage with frugality; -- said of a woman.'),
(36828, 'Hutted', 'imp. & p. p.', 'of Hutch'),
(36829, 'Hutting', 'p. pr. & vb. n.', 'of Hutch'),
(36830, 'Hutch', 'v. t. & i.', 'To place in huts; to live in huts; as, to hut troops\n   in winter quarters.'),
(36831, 'Hutch', 'n.', 'A chest, box, coffer, bin, coop, or the like, in which\n   things may be stored, or animals kept; as, a grain hutch; a rabbit\n   hutch.'),
(36832, 'Hutch', 'n.', 'A measure of two Winchester bushels.'),
(36833, 'Hutch', 'n.', 'The case of a flour bolt.'),
(36834, 'Hutch', 'n.', 'A car on low wheels, in which coal is drawn in the mine and\n   hoisted out of the pit.'),
(36835, 'Hutch', 'n.', 'A jig for washing ore.'),
(36836, 'Hutched', 'imp. & p. p.', 'of Hutch'),
(36837, 'Hutching', 'p. pr. & vb. n.', 'of Hutch'),
(36838, 'Hutch', 'v. t.', 'To hoard or lay up, in a chest.'),
(36839, 'Hutch', 'v. t.', 'To wash (ore) in a box or jig.'),
(36840, 'Huxter', 'n. & v. i.', 'See Huckster.'),
(36841, 'Huzza', 'interj.', 'A word used as a shout of joy, exultation, approbation,\n   or encouragement.'),
(36842, 'Huzza', 'n.', 'A shout of huzza; a cheer; a hurrah.'),
(36843, 'Huzzaed', 'imp. & p. p.', 'of Huzza'),
(36844, 'Huzzaing', 'p. pr. & vb. n.', 'of Huzza'),
(36845, 'Huzza', 'v. i.', 'To shout huzza; to cheer.'),
(36846, 'Huzza', 'v. t.', 'To receive or attend with huzzas.'),
(36847, 'Hyacine', 'n.', 'A hyacinth.'),
(36848, 'Hyacinth', 'n.', 'A bulbous plant of the genus Hyacinthus, bearing\n   beautiful spikes of fragrant flowers. H. orientalis is a common\n   variety.'),
(36849, 'Hyacinth', 'n.', 'A plant of the genus Camassia (C. Farseri), called also\n   Eastern camass; wild hyacinth.'),
(36850, 'Hyacinth', 'n.', 'The name also given to Scilla Peruviana, a Mediterranean\n   plant, one variety of which produces white, and another blue, flowers;\n   -- called also, from a mistake as to its origin, Hyacinth of Peru.'),
(36851, 'Hyacinth', 'n.', 'A red variety of zircon, sometimes used as a gem. See\n   Zircon.'),
(36852, 'Hyades', 'n.pl.', 'Alt. of Hyads'),
(36853, 'Hyads', 'n.pl.', 'A cluster of five stars in the face of the constellation\n   Taurus, supposed by the ancients to indicate the coming of rainy\n   weather when they rose with the sun.'),
(36854, 'Hyaena', 'n.', 'Same as Hyena.'),
(36855, 'Hyalea', 'n.', 'A pteroid of the genus Cavolina. See Pteropoda, and\n   Illustration in Appendix.'),
(36856, 'Hyaline', 'a.', 'Glassy; resembling glass; consisting of glass;\n   transparent, like crystal.'),
(36857, 'Hyaline', 'n.', 'A poetic term for the sea or the atmosphere.'),
(36858, 'Hyaline', 'n.', 'The pellucid substance, present in cells in process of\n   development, from which, according to some embryologists, the cell\n   nucleous originates.'),
(36859, 'Hyaline', 'n.', 'The main constituent of the walls of hydatid cysts; a\n   nitrogenous body, which, by decomposition, yields a dextrogyrate sugar,\n   susceptible of alcoholic fermentation.'),
(36860, 'Hyalite', 'n.', 'A pellucid variety of opal in globules looking like\n   colorless gum or resin; -- called also Muller\'s glass.'),
(36861, 'Hyaloid', 'a.', 'Resembling glass; vitriform; transparent; hyaline; as, the\n   hyaloid membrane, a very delicate membrane inclosing the vitreous humor\n   of the eye.'),
(36862, 'Hyblaean', 'a.', 'Pertaining to Hybla, an ancient town of Sicily, famous\n   for its bees.'),
(36863, 'Hybodont', 'a.', 'Of, pertaining to, or resembling, an extinct genus of\n   sharks (Hybodus), especially in the form of the teeth, which consist of\n   a principal median cone with smaller lateral ones.'),
(36864, 'Hybodus', 'n.', 'An extinct genus of sharks having conical, compressed\n   teeth.'),
(36865, 'Hybrid', 'n.', 'The offspring of the union of two distinct species; an\n   animal or plant produced from the mixture of two species. See Mongrel.'),
(36866, 'Hybrid', 'a.', 'Produced from the mixture of two species; as, plants of\n   hybrid nature.'),
(36867, 'Hydage', 'n.', 'A land tax. See Hidage.'),
(36868, 'Hydatid', 'n.', 'A membranous sac or bladder filled with a pellucid fluid,\n   found in various parts of the bodies of animals, but unconnected with\n   the tissues. It is usually formed by parasitic worms, esp. by larval\n   tapeworms, as Echinococcus and Coenurus. See these words in the\n   Vocabulary.'),
(36869, 'Hydatoid', 'a.', 'Resembling water; watery; aqueous; hyaloid.'),
(36870, 'Hydr-', '', 'See under Hydro-.'),
(36871, 'Hydras', 'pl. ', 'of Hydra'),
(36872, 'Hydrae', 'pl. ', 'of Hydra'),
(36873, 'Hydra', 'n.', 'A serpent or monster in the lake or marsh of Lerna, in the\n   Peloponnesus, represented as having many heads, one of which, when cut\n   off, was immediately succeeded by two others, unless the wound was\n   cauterized. It was slain by Hercules. Hence, a terrible monster.'),
(36874, 'Hydra', 'n.', 'Hence: A multifarious evil, or an evil having many sources;\n   not to be overcome by a single effort.'),
(36875, 'Hydra', 'n.', 'Any small fresh-water hydroid of the genus Hydra, usually\n   found attached to sticks, stones, etc., by a basal sucker.'),
(36876, 'Hydra', 'n.', 'A southern constellation of great length lying southerly\n   from Cancer, Leo, and Virgo.'),
(36877, 'Hydracid', 'n.', 'An acid containing hydrogen; -- sometimes applied to\n   distinguish acids like hydrochloric, hydrofluoric, and the like, which\n   contain no oxygen, from the oxygen acids or oxacids. See Acid.'),
(36878, 'Hydrant', 'n.', 'A discharge pipe with a valve and spout at which water may\n   be drawn from the mains of waterworks; a water plug.'),
(36879, 'Hydranth', 'n.', 'One of the nutritive zooids of a hydroid colony. Also\n   applied to the proboscis or manubrium of a hydroid medusa. See Illust.\n   of Hydroidea.'),
(36880, 'Hydrate', 'n.', 'A compound formed by the union of water with some other\n   substance, generally forming a neutral body, as certain crystallized\n   salts.'),
(36881, 'Hydrate', 'n.', 'A substance which does not contain water as such, but has\n   its constituents (hydrogen, oxygen, hydroxyl) so arranged that water\n   may be eliminated; hence, a derivative of, or compound with, hydroxyl;\n   hydroxide; as, ethyl hydrate, or common alcohol; calcium hydrate, or\n   slaked lime.'),
(36882, 'Hydrated', 'imp. & p. p.', 'of Hydrate'),
(36883, 'Hydrate', 'v. t.', 'To form into a hydrate; to combine with water.'),
(36884, 'Hydrated', 'a.', 'Formed into a hydrate; combined with water.'),
(36885, 'Hydria', 'n.', 'A water jar; esp., one with a large rounded body, a small\n   neck, and three handles. Some of the most beautiful Greek vases are of\n   this form.'),
(36886, 'Hydriad', 'n.', 'A water nymph.'),
(36887, 'Hydric', 'a.', 'Pertaining to, or containing, hydrogen; as, hydric oxide.'),
(36888, 'Hydride', 'n.', 'A compound of the binary type, in which hydrogen is united\n   with some other element.'),
(36889, 'Hydrina', 'n. pl.', 'The group of hydroids to which the fresh-water hydras\n   belong.'),
(36890, 'Hydro-', '', 'Alt. of Hydr-'),
(36891, 'Hydr-', '', 'A combining form from Gr. /, /, water (see Hydra).'),
(36892, 'Hydr-', '', 'A combining form of hydrogen, indicating hydrogen as an\n   ingredient, as hydrochloric; or a reduction product obtained by\n   hydrogen, as hydroquinone.'),
(36893, 'Hydrogen', 'n.', 'A gaseous element, colorless, tasteless, and odorless,\n   the lightest known substance, being fourteen and a half times lighter\n   than air (hence its use in filling balloons), and over eleven thousand\n   times lighter than water. It is very abundant, being an ingredient of\n   water and of many other substances, especially those of animal or\n   vegetable origin. It may by produced in many ways, but is chiefly\n   obtained by the action of acids (as sulphuric) on metals, as zinc,\n   iron, etc. It is very inflammable, and is an ingredient of coal gas and\n   water gas. It is standard of chemical equivalents or combining weights,\n   and also of valence, being the typical monad. Symbol H. Atomic weight\n   1.'),
(36894, 'Hydroid', 'a.', 'Related to, or resembling, the hydra; of or pertaining to\n   the Hydroidea.'),
(36895, 'Hydroid', 'n.', 'One of the Hydroideas.'),
(36896, 'Hydromel', 'n.', 'A liquor consisting of honey diluted in water, and after\n   fermentation called mead.'),
(36897, 'Hydropic', 'a.', 'Alt. of Hydropical'),
(36898, 'Hydropsy', 'n.', 'Same as Dropsy.'),
(36899, 'Hydrotic', 'a.', 'Causing a discharge of water or phlegm.'),
(36900, 'Hydrotic', 'n.', 'A hydrotic medicine.'),
(36901, 'Hydrous', 'a.', 'Containing water; watery.'),
(36902, 'Hydrous', 'a.', 'Containing water of hydration or crystallization.'),
(36903, 'Hydroxy-', '', 'A combining form, also used adjectively, indicating\n   hydroxyl as an ingredient.'),
(36904, 'Hydroxyl', 'n.', 'A compound radical, or unsaturated group, HO, consisting\n   of one atom of hydrogen and one of oxygen. It is a characteristic part\n   of the hydrates, the alcohols, the oxygen acids, etc.'),
(36905, 'Hydrozoa', 'n. pl.', 'The Acalephae; one of the classes of coelenterates,\n   including the Hydroidea, Discophora, and Siphonophora.'),
(36906, 'Hydrozoa', 'pl. ', 'of Hydrozoon'),
(36907, 'Hydruret', 'n.', 'A binary compound of hydrogen; a hydride.'),
(36908, 'Hydrus', 'n.', 'A constellation of the southern hemisphere, near the south\n   pole.'),
(36909, 'Hyemal', 'a.', 'Belonging to winter; done in winter.'),
(36910, 'Hyemate', 'v. i.', 'To pass the winter.'),
(36911, 'Hyenas', 'pl. ', 'of Hyena'),
(36912, 'Hyena', 'n.', 'Any carnivorous mammal of the family Hyaenidae, of which\n   three living species are known. They are large and strong, but\n   cowardly. They feed chiefly on carrion, and are nocturnal in their\n   habits.'),
(36913, 'Hyetal', 'a.', 'Of or pertaining to rain; descriptive of the distribution\n   of rain, or of rainy regions.'),
(36914, 'Hygeia', 'n.', 'The goddess of health, daughter of Esculapius.'),
(36915, 'Hygeian', 'a.', 'Relating to Hygeia, the goddess of health; of or\n   pertaining to health, or its preservation.'),
(36916, 'Hygeist', 'n.', 'One skilled in hygiena; a hygienist.'),
(36917, 'Hygieist', 'n.', 'A hygienist.'),
(36918, 'Hygiene', 'n.', 'That department of sanitary science which treats of the\n   preservation of health, esp. of households and communities; a system of\n   principles or rules designated for the promotion of health.'),
(36919, 'Hygienic', 'a.', 'Of or pertaining to health or hygiene; sanitary.'),
(36920, 'Hygrine', 'n.', 'An alkaloid associated with cocaine in coca leaves\n   (Erythroxylon coca), and extracted as a thick, yellow oil, having a\n   pungent taste and odor.'),
(36921, 'Hylic', 'a.', 'Of or pertaining to matter; material; corporeal; as, hylic\n   influences.'),
(36922, 'Hylicist', 'n.', 'A philosopher who treats chiefly of matter; one who\n   adopts or teaches hylism.'),
(36923, 'Hylism', 'n.', 'A theory which regards matter as the original principle of\n   evil.'),
(36924, 'Hylobate', 'n.', 'Any species of the genus Hylobates; a gibbon, or\n   long-armed ape. See Gibbon.'),
(36925, 'Hylodes', 'n.', 'The piping frog (Hyla Pickeringii), a small American tree\n   frog, which in early spring, while breeding in swamps and ditches,\n   sings with high, shrill, but musical, notes.'),
(36926, 'Hyloism', 'n.', 'Same as Hylotheism.'),
(36927, 'Hyloist', 'n.', 'Same as Hylotheist.'),
(36928, 'Hylozoic', 'a.', 'Of or pertaining to hylozoism.'),
(36929, 'Hymar', 'n.', 'The wild ass of Persia.'),
(36930, 'Hymen', 'n.', 'A fold of muscous membrane often found at the orifice of the\n   vagina; the vaginal membrane.'),
(36931, 'Hymen', 'n.', 'A fabulous deity; according to some, the son of Apollo and\n   Urania, according to others, of Bacchus and Venus. He was the god of\n   marriage, and presided over nuptial solemnities.'),
(36932, 'Hymen', 'n.', 'Marriage; union as if by marriage.'),
(36933, 'Hymeneal', 'n.', 'Alt. of Hymenean'),
(36934, 'Hymenean', 'n.', 'Of or pertaining to marriage; as, hymeneal rites.'),
(36935, 'Hymeneal', 'n.', 'Alt. of Hymenean'),
(36936, 'Hymenean', 'n.', 'A marriage song.'),
(36937, 'Hymenia', 'pl. ', 'of Hymenium'),
(36938, 'Hymenium', 'n.', 'The spore-bearing surface of certain fungi, as that on\n   the gills of a mushroom.'),
(36939, 'Hymned', 'imp. & p. p.', 'of Hymn'),
(36940, 'Hymning', 'p. pr. & vb. n.', 'of Hymn'),
(36941, 'Hymnal', 'n.', 'A collection of hymns; a hymn book.'),
(36942, 'Hymnic', 'a.', 'Relating to hymns, or sacred lyrics.'),
(36943, 'Hymning', 'a.', 'Praising with hymns; singing.'),
(36944, 'Hymning', 'n.', 'The singing of hymns.'),
(36945, 'Hymnist', 'n.', 'A writer of hymns.'),
(36946, 'Hymnody', 'n.', 'Hymns, considered collectively; hymnology.'),
(36947, 'Hympne', 'n.', 'A hymn.'),
(36948, 'Hyoid', 'a.', 'Having the form of an arch, or of the Greek letter upsilon\n   [/].'),
(36949, 'Hyoid', 'a.', 'Of or pertaining to the bony or cartilaginous arch which\n   supports the tongue. Sometimes applied to the tongue itself.'),
(36950, 'Hyoid', 'n.', 'The hyoid bone.'),
(36951, 'Hyoideal', 'a.', 'Alt. of Hyoidean'),
(36952, 'Hyoidean', 'a.', 'Same as Hyoid, a.'),
(36953, 'Hyoscine', 'n.', 'An alkaloid found with hyoscyamine (with which it is also\n   isomeric) in henbane, and extracted as a white, amorphous, semisolid\n   substance.'),
(36954, 'Hypaxial', 'a.', 'Beneath the axis of the skeleton; subvertebral;\n   hyposkeletal.'),
(36955, 'Hyper-', '', 'A prefix signifying over, above; as, hyperphysical,\n   hyperthyrion; also, above measure, abnormally great, excessive; as,\n   hyperaemia, hyperbola, hypercritical, hypersecretion.'),
(36956, 'Hyper-', '', 'A prefix equivalent to super- or per-; as hyperoxide, or\n   peroxide. [Obs.] See Per-.'),
(36957, 'Hyperion', 'n.', 'The god of the sun; in the later mythology identified\n   with Apollo, and distinguished for his beauty.'),
(36958, 'Hyphae', 'n. pl.', 'The long, branching filaments of which the mycelium\n   (and the greater part of the plant) of a fungus is formed. They are\n   also found enveloping the gonidia of lichens, making up a large part of\n   their structure.'),
(36959, 'Hyphen', 'n.', 'A mark or short dash, thus [-], placed at the end of a line\n   which terminates with a syllable of a word, the remainder of which is\n   carried to the next line; or between the parts of many a compound word;\n   as in fine-leaved, clear-headed. It is also sometimes used to separate\n   the syllables of words.'),
(36960, 'Hyphened', 'imp. & p. p.', 'of Hyphen'),
(36961, 'Hyphen', 'v. t.', 'To connect with, or separate by, a hyphen, as two words\n   or the parts of a word.'),
(36962, 'Hypnosis', 'n.', 'Supervention of sleep.'),
(36963, 'Hypnotic', 'a.', 'Having the quality of producing sleep; tending to produce\n   sleep; soporific.'),
(36964, 'Hypnotic', 'a.', 'Of or pertaining to hypnotism; in a state of hypnotism;\n   liable to hypnotism; as, a hypnotic condition.'),
(36965, 'Hypnotic', 'n.', 'Any agent that produces, or tends to produce, sleep; an\n   opiate; a soporific; a narcotic.'),
(36966, 'Hypnotic', 'n.', 'A person who exhibits the phenomena of, or is subject to,\n   hypnotism.'),
(36967, 'Hypnum', 'n.', 'The largest genus of true mosses; feather moss.'),
(36968, 'Hypo-', '', 'A prefix signifying a less quantity, or a low state or degree,\n   of that denoted by the word with which it is joined, or position under\n   or beneath.'),
(36969, 'Hypo-', '', 'A prefix denoting that the element to the name of which it is\n   prefixed enters with a low valence, or in a low state of oxidization,\n   usually the lowest, into the compounds indicated; as, hyposulphurous\n   acid.'),
(36970, 'Hypoaria', 'pl. ', 'of Hypoarion'),
(36971, 'Hypobole', 'n.', 'A figure in which several things are mentioned that seem\n   to make against the argument, or in favor of the opposite side, each of\n   them being refuted in order.'),
(36972, 'Hypocarp', 'n.', 'Alt. of Hypocarpium'),
(36973, 'Hypocist', 'n.', 'An astringent inspissated juice obtained from the fruit\n   of a plant (Cytinus hypocistis), growing from the roots of the Cistus,\n   a small European shrub.'),
(36974, '-tyla', 'pl. ', 'of Hypodactylum'),
(36975, 'Hypoderm', 'n.', 'Same as Hypoblast.'),
(36976, 'Hypogean', 'a.', 'Hypogeous.'),
(36977, 'Hypogene', 'a.', 'Formed or crystallized at depths the earth\'s surface; --\n   said of granite, gneiss, and other rocks, whose crystallization is\n   believed of have taken place beneath a great thickness of overlying\n   rocks. Opposed to epigene.'),
(36978, 'Hypogea', 'pl. ', 'of Hypogeum'),
(36979, 'Hypogeum', 'n.', 'The subterraneous portion of a building, as in\n   amphitheaters, for the service of the games; also, subterranean\n   galleries, as the catacombs.'),
(36980, 'Hypogyn', 'n.', 'An hypogynous plant.'),
(36981, 'Hypohyal', 'a.', 'Pertaining to one or more small elements in the hyoidean\n   arch of fishes, between the caratohyal and urohyal.'),
(36982, 'Hypohyal', 'n.', 'One of the hypohyal bones or cartilages.'),
(36983, 'Hypothec', 'n.', 'A landlord\'s right, independently of stipulation, over\n   the stocking (cattle, implements, etc.), and crops of his tenant, as\n   security for payment of rent.'),
(36984, 'Hypozoic', 'a.', 'Anterior in age to the lowest rocks which contain organic\n   remains.'),
(36985, 'Hyppish', 'a.', 'Affected with hypochondria; hypped.'),
(36986, 'Hypural', 'a.', 'Under the tail; -- applied to the bones which support the\n   caudal fin rays in most fishes.'),
(36987, 'Hyracoid', 'a.', 'Of or pertaining to the Hyracoidea.'),
(36988, 'Hyracoid', 'n.', 'One of the Hyracoidea.'),
(36989, 'Hyrax', 'n.', 'Any animal of the genus Hyrax, of which about four species\n   are known. They constitute the order Hyracoidea. The best known species\n   are the daman (H. Syriacus) of Palestine, and the klipdas (H. capensis)\n   of South Africa. Other species are H. arboreus and H. Sylvestris, the\n   former from Southern, and the latter from Western, Africa. See Daman.'),
(36990, 'Hyrcan', 'a.', 'Of or pertaining to Hyrcania, an ancient country or\n   province of Asia, southeast of the Caspian (which was also called the\n   Hyrcanian) Sea.'),
(36991, 'Hyrse', 'n.', 'Millet.'),
(36992, 'Hyrst', 'n.', 'A wood. See Hurst.'),
(36993, 'Hyson', 'n.', 'A fragrant kind of green tea.'),
(36994, 'Hyssop', 'n.', 'A plant (Hyssopus officinalis). The leaves have an aromatic\n   smell, and a warm, pungent taste.'),
(36995, 'Hysteria', 'n.', 'A nervous affection, occurring almost exclusively in\n   women, in which the emotional and reflex excitability is exaggerated,\n   and the will power correspondingly diminished, so that the patient\n   loses control over the emotions, becomes the victim of imaginary\n   sensations, and often falls into paroxism or fits.'),
(36996, 'Hysteric', 'a.', 'Alt. of Hysterical'),
(36997, 'Hystrix', 'n.', 'A genus of rodents, including the porcupine.'),
(36998, 'Hythe', 'n.', 'A small haven. See Hithe.\n   I () I, the ninth letter of the English alphabet, takes its form from\n   the Phoenician, through the Latin and the Greek. The Phoenician letter\n   was probably of Egyptian origin. Its original value was nearly the same\n   as that of the Italian I, or long e as in mete. Etymologically I is\n   most closely related to e, y, j, g; as in dint, dent, beverage, L.\n   bibere; E. kin, AS. cynn; E. thin, AS. /ynne; E. dominion, donjon,\n   dungeon.'),
(36999, 'Iambic', 'a.', 'Consisting of a short syllable followed by a long one, or\n   of an unaccented syllable followed by an accented; as, an iambic foot.'),
(37000, 'Iambic', 'a.', 'Pertaining to, or composed of, iambics; as, an iambic\n   verse; iambic meter. See Lambus.'),
(37001, 'Iambic', 'n.', 'An iambic foot; an iambus.'),
(37002, 'Iambic', 'n.', 'A verse composed of iambic feet.'),
(37003, 'Iambic', 'n.', 'A satirical poem (such poems having been anciently written\n   in iambic verse); a satire; a lampoon.'),
(37004, 'Iambical', 'a.', 'Iambic.'),
(37005, 'Iambize', 'v. t.', 'To satirize in iambics; to lampoon.'),
(37006, 'Iambi', 'pl. ', 'of Iambus'),
(37007, 'Iambuses', 'pl. ', 'of Iambus'),
(37008, 'Iambus', 'n.', 'A foot consisting of a short syllable followed by a long\n   one, as in /mans, or of an unaccented syllable followed by an accented\n   one, as invent; an iambic. See the Couplet under Iambic, n.'),
(37009, 'Ianthina', 'n.', 'Any gastropod of the genus Ianthina, of which various\n   species are found living in mid ocean; -- called also purple shell, and\n   violet snail.'),
(37010, 'Iatric', 'a.', 'Alt. of Iatrical'),
(37011, 'Iatrical', 'a.', 'Of or pertaining to medicine, or to medical men.'),
(37012, 'Iberian', 'a.', 'Of or pertaining to Iberia.'),
(37013, 'Ibexes', 'pl. ', 'of Ibex'),
(37014, 'Ibices', 'pl. ', 'of Ibex'),
(37015, 'Ibidem', 'adv.', 'In the same place; -- abbreviated ibid. or ib.'),
(37016, '-ible', '', 'See -able.'),
(37017, 'Icarian', 'a.', 'Soaring too high for safety, like Icarus; adventurous in\n   flight.'),
(37018, 'Icing', 'p. pr. & vb. n.', 'of Ice'),
(37019, 'Iceberg', 'n.', 'A large mass of ice, generally floating in the ocean.'),
(37020, 'Icebird', 'n.', 'An Arctic sea bird, as the Arctic fulmar.'),
(37021, 'Icebound', 'a.', 'Totally surrounded with ice, so as to be incapable of\n   advancing; as, an icebound vessel; also, surrounded by or fringed with\n   ice so as to hinder easy access; as, an icebound coast.'),
(37022, 'Icefall', 'n.', 'A frozen waterfall, or mass of ice resembling a frozen\n   waterfall.'),
(37023, 'Icemen', 'pl. ', 'of Iceman'),
(37024, 'Iceman', 'n.', 'A man who is skilled in traveling upon ice, as among\n   glaciers.'),
(37025, 'Iceman', 'n.', 'One who deals in ice; one who retails or delivers ice.'),
(37026, 'Icequake', 'n.', 'The crash or concussion attending the breaking up of\n   masses of ice, -- often due to contraction from extreme cold.'),
(37027, 'Ichnite', 'n.', 'A fossil footprint; as, the ichnites in the Triassic\n   sandstone.'),
(37028, 'Ichor', 'n.', 'An ethereal fluid that supplied the place of blood in the\n   veins of the gods.'),
(37029, 'Ichor', 'n.', 'A thin, acrid, watery discharge from an ulcer, wound, etc.'),
(37030, 'Ichorous', 'a.', 'Of or like ichor; thin; watery; serous; sanious.'),
(37031, 'Ichthin', 'n.', 'A nitrogenous substance resembling vitellin, present in\n   the egg yolk of cartilaginous fishes.'),
(37032, 'Ichthus', 'n.', 'In early Christian and eccesiastical art, an emblematic\n   fish, or the Greek word for fish, which combined the initials of the\n   Greek words /, /, / /, /, Jesus, Christ, Son of God, Savior.'),
(37033, 'Ichthyic', 'a.', 'Like, or pertaining to, fishes.'),
(37034, 'Ichthys', 'n.', 'Same as Ichthus.'),
(37035, 'Icicle', 'n.', 'A pendent, and usually conical, mass of ice, formed by\n   freezing of dripping water; as, the icicles on the eaves of a house.'),
(37036, 'Icicled', 'a.', 'Having icicles attached.'),
(37037, 'Icily', 'adv.', 'In an icy manner; coldly.'),
(37038, 'Iciness', 'n.', 'The state or quality of being icy or very cold; frigidity.'),
(37039, 'Icing', 'n.', 'A coating or covering resembling ice, as of sugar and milk\n   or white of egg; frosting.'),
(37040, 'Ickle', 'n.', 'An icicle.'),
(37041, 'Iconical', 'a.', 'Pertaining to, or consisting of, images, pictures, or\n   representations of any kind.'),
(37042, 'Iconism', 'n.', 'The formation of a figure, representation, or semblance; a\n   delineation or description.'),
(37043, 'Iconize', 'v. t.', 'To form an image or likeness of.'),
(37044, 'Icteric', 'n.', 'A remedy for the jaundice.'),
(37045, 'Icteric', 'a.', 'Alt. of Icterical'),
(37046, 'Icteroid', 'a.', 'Of a tint resembling that produced by jaundice; yellow;\n   as, an icteroid tint or complexion.'),
(37047, 'Icterus', 'a.', 'The jaundice.'),
(37048, 'Ictic', 'a.', 'Pertaining to, or caused by, a blow; sudden; abrupt.'),
(37049, 'Ictus', 'n.', 'The stress of voice laid upon accented syllable of a word.\n   Cf. Arsis.'),
(37050, 'Ictus', 'n.', 'A stroke or blow, as in a sunstroke, the sting of an insect,\n   pulsation of an artery, etc.'),
(37051, 'Idalian', 'a.', 'Of or pertaining to Idalium, a mountain city in Cyprus, or\n   to Venus, to whom it was sacred.'),
(37052, 'Ideas', 'pl. ', 'of Idea'),
(37053, 'Ideal', 'a.', 'Existing in idea or thought; conceptional; intellectual;\n   mental; as, ideal knowledge.'),
(37054, 'Ideal', 'a.', 'Reaching an imaginary standard of excellence; fit for a\n   model; faultless; as, ideal beauty.'),
(37055, 'Ideal', 'a.', 'Existing in fancy or imagination only; visionary; unreal.'),
(37056, 'Ideal', 'a.', 'Teaching the doctrine of idealism; as, the ideal theory or\n   philosophy.'),
(37057, 'Ideal', 'a.', 'Imaginary.'),
(37058, 'Ideal', 'n.', 'A mental conception regarded as a standard of perfection; a\n   model of excellence, beauty, etc.'),
(37059, 'Idealess', 'a.', 'Destitute of an idea.'),
(37060, 'Idealism', 'n.', 'The quality or state of being ideal.'),
(37061, 'Idealism', 'n.', 'Conception of the ideal; imagery.'),
(37062, 'Idealism', 'n.', 'The system or theory that denies the existence of\n   material bodies, and teaches that we have no rational grounds to\n   believe in the reality of anything but ideas and their relations.'),
(37063, 'Idealist', 'n.', 'One who idealizes; one who forms picturesque fancies; one\n   given to romantic expectations.'),
(37064, 'Idealist', 'n.', 'One who holds the doctrine of idealism.'),
(37065, 'Ideality', 'n.', 'The quality or state of being ideal.'),
(37066, 'Ideality', 'n.', 'The capacity to form ideals of beauty or perfection.'),
(37067, 'Ideality', 'n.', 'The conceptive faculty.'),
(37068, 'Idealize', 'v. t.', 'To make ideal; to give an ideal form or value to; to\n   attribute ideal characteristics and excellences to; as, to idealize\n   real life.'),
(37069, 'Idealize', 'v. t.', 'To treat in an ideal manner. See Idealization, 2.'),
(37070, 'Idealize', 'v. i.', 'To form ideals.'),
(37071, 'Ideally', 'adv.', 'In an ideal manner; by means of ideals; mentally.'),
(37072, 'Ideat', 'n.', 'Alt. of Ideate'),
(37073, 'Ideate', 'n.', 'The actual existence supposed to correspond with an idea;\n   the correlate in real existence to the idea as a thought or existence.'),
(37074, 'Ideate', 'v. t.', 'To form in idea; to fancy.'),
(37075, 'Ideate', 'v. t.', 'To apprehend in thought so as to fix and hold in the\n   mind; to memorize.'),
(37076, 'Ideation', 'n.', 'The faculty or capacity of the mind for forming ideas;\n   the exercise of this capacity; the act of the mind by which objects of\n   sense are apprehended and retained as objects of thought.'),
(37077, 'Identic', 'a.', 'Identical.'),
(37078, 'Identify', 'v. t.', 'To make to be the same; to unite or combine in such a\n   manner as to make one; to treat as being one or having the same purpose\n   or effect; to consider as the same in any relation.'),
(37079, 'Identify', 'v. t.', 'To establish the identity of; to prove to be the same\n   with something described, claimed, or asserted; as, to identify stolen\n   property.'),
(37080, 'Identify', 'v. i.', 'To become the same; to coalesce in interest, purpose,\n   use, effect, etc.'),
(37081, 'Identism', 'n.', 'The doctrine taught by Schelling, that matter and mind,\n   and subject and object, are identical in the Absolute; -- called also\n   the system / doctrine of identity.'),
(37082, 'Identity', 'n.', 'The state or quality of being identical, or the same;\n   sameness.'),
(37083, 'Identity', 'n.', 'The condition of being the same with something described\n   or asserted, or of possessing a character claimed; as, to establish the\n   identity of stolen goods.'),
(37084, 'Identity', 'n.', 'An identical equation.'),
(37085, 'Ideo-', '', 'A combining form from the Gr. /, an idea.'),
(37086, 'Ideogeny', 'n.', 'The science which treats of the origin of ideas.'),
(37087, 'Ideogram', 'n.', 'An original, pictorial element of writing; a kind of\n   hieroglyph expressing no sound, but only an idea.'),
(37088, 'Ideogram', 'n.', 'A symbol used for convenience, or for abbreviation; as,\n   1, 2, 3, +, -, /, $, /, etc.'),
(37089, 'Ideogram', 'n.', 'A phonetic symbol; a letter.'),
(37090, 'Ideology', 'n.', 'The science of ideas.'),
(37091, 'Ideology', 'n.', 'A theory of the origin of ideas which derives them\n   exclusively from sensation.'),
(37092, 'Idio-', '', 'A combining form from the Greek /, meaning private, personal,\n   peculiar, distinct.'),
(37093, 'Idiocy', 'n.', 'The condition or quality of being an idiot; absence, or\n   marked deficiency, of sense and intelligence.'),
(37094, 'Idiom', 'n.', 'The syntactical or structural form peculiar to any language;\n   the genius or cast of a language.'),
(37095, 'Idiom', 'n.', 'An expression conforming or appropriate to the peculiar\n   structural form of a language; in extend use, an expression sanctioned\n   by usage, having a sense peculiar to itself and not agreeing with the\n   logical sense of its structural form; also, the phrase forms peculiar\n   to a particular author.'),
(37096, 'Idiom', 'n.', 'Dialect; a variant form of a language.'),
(37097, 'Idiot', 'n.', 'A man in private station, as distinguished from one holding\n   a public office.'),
(37098, 'Idiot', 'n.', 'An unlearned, ignorant, or simple person, as distinguished\n   from the educated; an ignoramus.'),
(37099, 'Idiot', 'n.', 'A human being destitute of the ordinary intellectual powers,\n   whether congenital, developmental, or accidental; commonly, a person\n   without understanding from birth; a natural fool; a natural; an\n   innocent.'),
(37100, 'Idiot', 'n.', 'A fool; a simpleton; -- a term of reproach.'),
(37101, 'Idiotcy', 'n.', 'Idiocy.'),
(37102, 'Idioted', 'a.', 'Rendered idiotic; befooled.'),
(37103, 'Idiotic', 'a.', 'Alt. of Idiotical'),
(37104, 'Idiotish', 'a.', 'Like an idiot; foolish.'),
(37105, 'Idiotism', 'n.', 'An idiom; a form, mode of expression, or signification,\n   peculiar to a language.'),
(37106, 'Idiotism', 'n.', 'Lack of knowledge or mental capacity; idiocy;\n   foolishness.'),
(37107, 'Idiotize', 'v. i.', 'To become stupid.'),
(37108, 'Idiotry', 'n.', 'Idiocy.'),
(37109, 'Idled', 'imp. & p. p.', 'of Idle'),
(37110, 'Idling', 'p. pr. & vb. n.', 'of Idle'),
(37111, 'Idleness', 'n.', 'The condition or quality of being idle (in the various\n   senses of that word); uselessness; fruitlessness; triviality;\n   inactivity; laziness.'),
(37112, 'Idler', 'n.', 'One who idles; one who spends his time in inaction; a lazy\n   person; a sluggard.'),
(37113, 'Idler', 'n.', 'One who has constant day duties on board ship, and keeps no\n   regular watch.'),
(37114, 'Idler', 'n.', 'An idle wheel or pulley. See under Idle.'),
(37115, 'Idless', 'n.', 'Alt. of Idlesse'),
(37116, 'Idlesse', 'n.', 'Idleness.'),
(37117, 'Idocrase', 'n.', 'Same as Vesuvianite.'),
(37118, 'Idolater', 'n.', 'A worshiper of idols; one who pays divine honors to\n   images, statues, or representations of anything made by hands; one who\n   worships as a deity that which is not God; a pagan.'),
(37119, 'Idolater', 'n.', 'An adorer; a great admirer.'),
(37120, 'Idolatry', 'n.', 'The worship of idols, images, or anything which is not\n   God; the worship of false gods.'),
(37121, 'Idolatry', 'n.', 'Excessive attachment or veneration for anything; respect\n   or love which borders on adoration.'),
(37122, 'Idolish', 'a.', 'Idolatrous.'),
(37123, 'Idolism', 'n.', 'The worship of idols.'),
(37124, 'Idolist', 'n.', 'A worshiper of idols.'),
(37125, 'Idolized', 'imp. & p. p.', 'of Idolize'),
(37126, 'Idolize', 'v. t.', 'To make an idol of; to pay idolatrous worship to; as,\n   to idolize the sacred bull in Egypt.'),
(37127, 'Idolize', 'v. t.', 'To love to excess; to love or reverence to adoration;\n   as, to idolize gold, children, a hero.'),
(37128, 'Idolize', 'v. i.', 'To practice idolatry.'),
(37129, 'Idolizer', 'n.', 'One who idolizes or loves to the point of reverence; an\n   idolater.'),
(37130, 'Idolous', 'a.', 'Idolatrous.'),
(37131, 'Idoneous', 'a.', 'Appropriate; suitable; proper; fit; adequate.'),
(37132, 'Idorgan', 'n.', 'A morphological unit, consisting of two or more plastids,\n   which does not possess the positive character of the person or stock,\n   in distinction from the physiological organ or biorgan. See Morphon.'),
(37133, 'Idumean', 'a.', 'Of or pertaining to ancient Idumea, or Edom, in Western\n   Asia.'),
(37134, 'Idumean', 'n.', 'An inhabitant of Idumea, an Edomite.'),
(37135, 'Idyllic', 'a.', 'Of or belonging to idyls.'),
(37136, 'I. e.', '', 'Abbreviation of Latin id est, that is.'),
(37137, 'I faith', '', 'In faith; indeed; truly.'),
(37138, 'Ifere', 'a.', 'Together.'),
(37139, 'Igasuric', 'a.', 'Pertaining to, or obtained from, nux vomica or St.\n   Ignatius\'s bean; as, igasuric acid.'),
(37140, 'Igloo', 'n.', 'An Eskimo snow house.'),
(37141, 'Igloo', 'n.', 'A cavity, or excavation, made in the snow by a seal, over\n   its breathing hole in the ice.'),
(37142, 'Igneous', 'a.', 'Pertaining to, having the nature of, fire; containing\n   fire; resembling fire; as, an igneous appearance.'),
(37143, 'Igneous', 'a.', 'Resulting from, or produced by, the action of fire; as,\n   lavas and basalt are igneous rocks.'),
(37144, 'Ignified', 'imp. & p. p.', 'of Ignify'),
(37145, 'Ignify', 'v. t.', 'To form into fire.'),
(37146, 'Ignited', 'imp. & p. p.', 'of Ignite'),
(37147, 'Igniting', 'p. pr. & vb. n.', 'of Ignite'),
(37148, 'Ignite', 'v. t.', 'To kindle or set on fire; as, to ignite paper or wood.'),
(37149, 'Ignite', 'v. t.', 'To subject to the action of intense heat; to heat\n   strongly; -- often said of incombustible or infusible substances; as,\n   to ignite iron or platinum.'),
(37150, 'Ignite', 'v. i.', 'To take fire; to begin to burn.'),
(37151, 'Ignition', 'n.', 'The act of igniting, kindling, or setting on fire.'),
(37152, 'Ignition', 'n.', 'The state of being ignited or kindled.'),
(37153, 'Ignitor', 'n.', 'One who, or that which, produces ignition; especially, a\n   contrivance for igniting the powder in a torpedo or the like.'),
(37154, 'Ignoble', 'a.', 'Of low birth or family; not noble; not illustrious;\n   plebeian; common; humble.'),
(37155, 'Ignoble', 'a.', 'Not honorable, elevated, or generous; base.'),
(37156, 'Ignoble', 'a.', 'Not a true or noble falcon; -- said of certain hawks, as\n   the goshawk.'),
(37157, 'Ignoble', 'v. t.', 'To make ignoble.'),
(37158, 'Ignobly', 'adv.', 'In an ignoble manner; basely.'),
(37159, 'Ignominy', 'n.', 'Public disgrace or dishonor; reproach; infamy.'),
(37160, 'Ignominy', 'n.', 'An act deserving disgrace; an infamous act.'),
(37161, 'Ignomy', 'n.', 'Ignominy.'),
(37162, 'Ignorant', 'a.', 'Destitute of knowledge; uninstructed or uninformed;\n   untaught; unenlightened.'),
(37163, 'Ignorant', 'a.', 'Unacquainted with; unconscious or unaware; -- used with\n   of.'),
(37164, 'Ignorant', 'a.', 'Unknown; undiscovered.'),
(37165, 'Ignorant', 'a.', 'Resulting from ignorance; foolish; silly.'),
(37166, 'Ignorant', 'n.', 'A person untaught or uninformed; one unlettered or\n   unskilled; an ignoramous.'),
(37167, 'Ignored', 'imp. & p. p.', 'of Ignore'),
(37168, 'Ignoring', 'p. pr. & vb. n.', 'of Ignore'),
(37169, 'Ignore', 'v. t.', 'To be ignorant of or not acquainted with.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(37170, 'Ignore', 'v. t.', 'To throw out or reject as false or ungrounded; -- said\n   of a bill rejected by a grand jury for want of evidence. See Ignoramus.'),
(37171, 'Ignore', 'v. t.', 'Hence: To refuse to take notice of; to shut the eyes to;\n   not to recognize; to disregard willfully and causelessly; as, to ignore\n   certain facts; to ignore the presence of an objectionable person.'),
(37172, 'Ignote', 'a.', 'Unknown.'),
(37173, 'Ignote', 'n.', 'One who is unknown.'),
