(37644, 'Inaquate', 'a.', 'Embodied in, or changed into, water.'),
(37645, 'Inarable', 'a.', 'Not arable.'),
(37646, 'Inarched', 'imp. & p. p.', 'of Inarch'),
(37647, 'Inarch', 'v. t.', 'To graft by uniting, as a scion, to a stock, without\n   separating either from its root before the union is complete; -- also\n   called to graft by approach.'),
(37648, 'Inasmuch', 'adv.', 'In like degree; in like manner; seeing that;\n   considering that; since; -- followed by as. See In as much as, under\n   In, prep.'),
(37649, 'Inaugur', 'v. t.', 'To inaugurate.'),
(37650, 'Inaurate', 'a.', 'Covered with gold; gilded.'),
(37651, 'Inaurate', 'v. t.', 'To cover with gold; to gild.'),
(37652, 'Inbarge', 'v. t. & i.', 'To embark; to go or put into a barge.'),
(37653, 'Inbeing', 'n.', 'Inherence; inherent existence.'),
(37654, 'Inbind', 'v. t.', 'To inclose.'),
(37655, 'Inblown', 'a.', 'Blown in or into.'),
(37656, 'Inboard', 'a. & adv.', 'Inside the line of a vessel\'s bulwarks or hull; the\n   opposite of outboard; as, an inboard cargo; haul the boom inboard.'),
(37657, 'Inboard', 'a. & adv.', 'From without inward; toward the inside; as, the\n   inboard stroke of a steam engine piston, the inward or return stroke.'),
(37658, 'Inborn', 'a.', 'Born in or with; implanted by nature; innate; as, inborn\n   passions.'),
(37659, 'Inbreak', 'n.', 'Alt. of Inbreaking'),
(37660, 'Inbred', 'a.', 'Bred within; innate; as, inbred worth.'),
(37661, 'Inbred', 'imp. & p. p.', 'of Inbreed'),
(37662, 'Inbreed', 'v. t.', 'To produce or generate within.'),
(37663, 'Inbreed', 'v. t.', 'To breed in and in. See under Breed, v. i.'),
(37664, 'Inburnt', 'a.', 'Burnt in; ineffaceable.'),
(37665, 'Inburst', 'n.', 'A bursting in or into.'),
(37666, 'Incaged', 'imp. & p. p.', 'of Incage'),
(37667, 'Incaging', 'p. pr. & vb. n.', 'of Incage'),
(37668, 'Incage', 'v. t.', 'To confine in, or as in, a cage; to coop up.'),
(37669, 'Incan', 'a.', 'Of or pertaining to the Incas.'),
(37670, 'Incanous', 'a.', 'Hoary with white pubescence.'),
(37671, 'Incanton', 'v. t.', 'To unite to, or form into, a canton or separate\n   community.'),
(37672, 'Incarn', 'v. t.', 'To cover or invest with flesh.'),
(37673, 'Incarn', 'v. i.', 'To develop flesh.'),
(37674, 'Incased', 'imp. & p. p.', 'of Incase'),
(37675, 'Incasing', 'p. pr. & vb. n.', 'of Incase'),
(37676, 'Incase', 'v. t.', 'To inclose in a case; to inclose; to cover or surround\n   with something solid.'),
(37677, 'Incask', 'v. t.', 'To cover with a casque or as with a casque.'),
(37678, 'Incaved', 'a.', 'Inclosed in a cave.'),
(37679, 'Incend', 'v. t.', 'To inflame; to excite.'),
(37680, 'Incensed', 'imp. & p. p.', 'of Incense'),
(37681, 'Incense', 'v. t.', 'To set on fire; to inflame; to kindle; to burn.'),
(37682, 'Incense', 'v. t.', 'To inflame with anger; to endkindle; to fire; to\n   incite; to provoke; to heat; to madden.'),
(37683, 'Incensed', 'imp. & p. p.', 'of Incense'),
(37684, 'Incense', 'n.', 'To offer incense to. See Incense.'),
(37685, 'Incense', 'n.', 'To perfume with, or as with, incense.'),
(37686, 'Incense', 'n.', 'The perfume or odors exhaled from spices and gums when\n   burned in celebrating religious rites or as an offering to some deity.'),
(37687, 'Incense', 'n.', 'The materials used for the purpose of producing a perfume\n   when burned, as fragrant gums, spices, frankincense, etc.'),
(37688, 'Incense', 'n.', 'Also used figuratively.'),
(37689, 'Incensed', 'a.', 'Angered; enraged.'),
(37690, 'Incensed', 'a.', 'Represented as enraged, as any wild creature depicted\n   with fire issuing from mouth and eyes.'),
(37691, 'Incenser', 'n.', 'One who instigates or incites.'),
(37692, 'Incensor', 'n.', 'A kindler of anger or enmity; an inciter.'),
(37693, 'Incenter', 'n.', 'The center of the circle inscribed in a triangle.'),
(37694, 'Inceptor', 'n.', 'A beginner; one in the rudiments.'),
(37695, 'Inceptor', 'n.', 'One who is on the point of taking the degree of master of\n   arts at an English university.'),
(37696, 'Incertum', 'a.', 'Doubtful; not of definite form.'),
(37697, 'Incest', 'n.', 'The crime of cohabitation or sexual commerce between\n   persons related within the degrees wherein marriage is prohibited by\n   law.'),
(37698, 'Inched', 'imp. & p. p.', 'of Inch'),
(37699, 'Inching', 'p. pr. & vb. n.', 'of Inch'),
(37700, 'Inchant', 'v. t.', 'See Enchant.'),
(37701, 'Inchase', 'v. t.', 'See Enchase.'),
(37702, 'Inched', 'a.', 'Having or measuring (so many) inches; as, a four-inched\n   bridge.'),
(37703, 'Inchest', 'v. t.', 'To put into a chest.'),
(37704, 'Inchipin', 'n.', 'See Inchpin.'),
(37705, 'Inchmeal', 'n.', 'A piece an inch long.'),
(37706, 'Inchmeal', 'adv.', 'Little by little; gradually.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(37707, 'Inchoate', 'a.', 'Recently, or just, begun; beginning; partially but not\n   fully in existence or operation; existing in its elements; incomplete.'),
(37708, 'Inchoate', 'v. t.', 'To begin.'),
(37709, 'Inchpin', 'n.', 'The sweetbread of a deer.'),
(37710, 'Inchworm', 'n.', 'The larva of any geometrid moth. See Geometrid.'),
(37711, 'Incide', 'v. t.', 'To cut; to separate and remove; to resolve or break up,\n   as by medicines.'),
(37712, 'Incident', 'a.', 'Falling or striking upon, as a ray of light upon a\n   reflecting surface.'),
(37713, 'Incident', 'a.', 'Coming or happening accidentally; not in the usual course\n   of things; not in connection with the main design; not according to\n   expectation; casual; fortuitous.'),
(37714, 'Incident', 'a.', 'Liable to happen; apt to occur; befalling; hence,\n   naturally happening or appertaining.'),
(37715, 'Incident', 'a.', 'Dependent upon, or appertaining to, another thing, called\n   the principal.'),
(37716, 'Incident', 'n.', 'That which falls out or takes place; an event; casualty;\n   occurrence.'),
(37717, 'Incident', 'n.', 'That which happens aside from the main design; an\n   accidental or subordinate action or event.'),
(37718, 'Incident', 'n.', 'Something appertaining to, passing with, or depending on,\n   another, called the principal.'),
(37719, 'Incircle', 'v. t.', 'See Encircle.'),
(37720, 'Incised', 'imp. & p. p.', 'of Incise'),
(37721, 'Incising', 'p. pr. & vb. n.', 'of Incise'),
(37722, 'Incise', 'v. t.', 'To cut in or into with a sharp instrument; to carve; to\n   engrave.'),
(37723, 'Incise', 'v. t.', 'To cut, gash, or wound with a sharp instrument; to cut\n   off.'),
(37724, 'Incised', 'a.', 'Cut in; carved; engraved.'),
(37725, 'Incised', 'a.', 'Having deep and sharp notches, as a leaf or a petal.'),
(37726, 'Incisely', 'adv.', 'In an incised manner.'),
(37727, 'Incision', 'n.', 'The act of incising, or cutting into a substance.'),
(37728, 'Incision', 'n.', 'That which is produced by incising; the separation of the\n   parts of any substance made by a cutting or pointed instrument; a cut;\n   a gash.'),
(37729, 'Incision', 'n.', 'Separation or solution of viscid matter by medicines.'),
(37730, 'Incisive', 'a.', 'Having the quality of incising, cutting, or penetrating,\n   as with a sharp instrument; cutting; hence, sharp; acute; sarcastic;\n   biting.'),
(37731, 'Incisive', 'a.', 'Of or pertaining to the incisors; incisor; as, the\n   incisive bones, the premaxillaries.'),
(37732, 'Incisor', 'n.', 'One of the teeth in front of the canines in either jaw; an\n   incisive tooth. See Tooth.'),
(37733, 'Incisor', 'a.', 'Adapted for cutting; of or pertaining to the incisors;\n   incisive; as, the incisor nerve; an incisor foramen; an incisor tooth.'),
(37734, 'Incisory', 'a.', 'Having the quality of cutting; incisor; incisive.'),
(37735, 'Incisure', 'n.', 'A cut; an incision; a gash.'),
(37736, 'Incitant', 'a.', 'Inciting; stimulating.'),
(37737, 'Incitant', 'n.', 'That which incites; an inciting agent or cause; a\n   stimulant.'),
(37738, 'Incited', 'imp. & p. p.', 'of Incite'),
(37739, 'Inciting', 'p. pr. & vb. n.', 'of Incite'),
(37740, 'Incite', 'v. t.', 'To move to action; to stir up; to rouse; to spur or urge\n   on.'),
(37741, 'Inciter', 'n.', 'One who, or that which, incites.'),
(37742, 'Incivil', 'a.', 'Uncivil; rude.'),
(37743, 'Incivism', 'n.', 'Want of civism; want of patriotism or love to one\'s\n   country; unfriendliness to one\'s state or government.'),
(37744, 'Inclasp', 'v. t.', 'To clasp within; to hold fast to; to embrace or\n   encircle.'),
(37745, 'Inclave', 'a.', 'Resembling a series of dovetails; -- said of a line of\n   division, such as the border of an ordinary.'),
(37746, 'Incle', 'n.', 'Same as Inkle.'),
(37747, 'Inclined', 'imp. & p. p.', 'of Incline'),
(37748, 'Incline', 'v. i.', 'To deviate from a line, direction, or course, toward an\n   object; to lean; to tend; as, converging lines incline toward each\n   other; a road inclines to the north or south.'),
(37749, 'Incline', 'v. i.', 'Fig.: To lean or tend, in an intellectual or moral\n   sense; to favor an opinion, a course of conduct, or a person; to have a\n   propensity or inclination; to be disposed.'),
(37750, 'Incline', 'v. i.', 'To bow; to incline the head.'),
(37751, 'Incline', 'v. t.', 'To cause to deviate from a line, position, or\n   direction; to give a leaning, bend, or slope to; as, incline the column\n   or post to the east; incline your head to the right.'),
(37752, 'Incline', 'v. t.', 'To impart a tendency or propensity to, as to the will\n   or affections; to turn; to dispose; to influence.'),
(37753, 'Incline', 'v. t.', 'To bend; to cause to stoop or bow; as, to incline the\n   head or the body in acts of reverence or civility.'),
(37754, 'Incline', 'n.', 'An inclined plane; an ascent o/ descent; a grade or\n   gradient; a slope.'),
(37755, 'Inclined', 'p. p. & a.', 'Having a leaning or tendency towards, or away\n   from, a thing; disposed or moved by wish, desire, or judgment; as, a\n   man inclined to virtue.'),
(37756, 'Inclined', 'p. p. & a.', 'Making an angle with some line or plane; -- said\n   of a line or plane.'),
(37757, 'Inclined', 'p. p. & a.', 'Bent out of a perpendicular position, or into a\n   curve with the convex side uppermost.'),
(37758, 'Incliner', 'n.', 'One who, or that which, inclines; specifically, an\n   inclined dial.'),
(37759, 'Inclip', 'v. t.', 'To clasp; to inclose.'),
(37760, 'Inclosed', 'imp. & p. p.', 'of Inclose'),
(37761, 'Inclose', 'v. t.', 'To surround; to shut in; to confine on all sides; to\n   include; to shut up; to encompass; as, to inclose a fort or an army\n   with troops; to inclose a town with walls.'),
(37762, 'Inclose', 'v. t.', 'To put within a case, envelope, or the like; to fold (a\n   thing) within another or into the same parcel; as, to inclose a letter\n   or a bank note.'),
(37763, 'Inclose', 'v. t.', 'To separate from common grounds by a fence; as, to\n   inclose lands.'),
(37764, 'Inclose', 'v. t.', 'To put into harness; to harness.'),
(37765, 'Incloser', 'n.', 'One who, or that which, incloses; one who fences off land\n   from common grounds.'),
(37766, 'Incloud', 'v. t.', 'To envelop as in clouds; to darken; to obscure.'),
(37767, 'Included', 'imp. & p. p.', 'of Include'),
(37768, 'Include', 'v. t.', 'To confine within; to hold; to contain; to shut up; to\n   inclose; as, the shell of a nut includes the kernel; a pearl is\n   included in a shell.'),
(37769, 'Include', 'v. t.', 'To comprehend or comprise, as a genus the species, the\n   whole a part, an argument or reason the inference; to contain; to\n   embrace; as, this volume of Shakespeare includes his sonnets; he was\n   included in the invitation to the family; to and including page\n   twenty-five.'),
(37770, 'Include', 'v. t.', 'To conclude; to end; to terminate.'),
(37771, 'Included', 'a.', 'Inclosed; confined.'),
(37772, 'Inclusa', 'n. pl.', 'A tribe of bivalve mollusks, characterized by the\n   closed state of the mantle which envelops the body. The ship borer\n   (Teredo navalis) is an example.'),
(37773, 'Incoach', 'v. t.', 'To put a coach.'),
(37774, 'Incoact', 'a.', 'Alt. of Incoacted'),
(37775, 'Incocted', 'a.', 'Raw; indigestible.'),
(37776, 'Incog', 'adv.', 'Incognito.'),
(37777, 'Incomber', 'v. t.', 'See Encumber.'),
(37778, 'Income', 'n.', 'A coming in; entrance; admittance; ingress; infusion.'),
(37779, 'Income', 'n.', 'That which is caused to enter; inspiration; influence;\n   hence, courage or zeal imparted.'),
(37780, 'Income', 'n.', 'That gain which proceeds from labor, business, property, or\n   capital of any kind, as the produce of a farm, the rent of houses, the\n   proceeds of professional business, the profits of commerce or of\n   occupation, or the interest of money or stock in funds, etc.; revenue;\n   receipts; salary; especially, the annual receipts of a private person,\n   or a corporation, from property; as, a large income.'),
(37781, 'Income', 'n.', 'That which is taken into the body as food; the ingesta; --\n   sometimes restricted to the nutritive, or digestible, portion of the\n   food. See Food. Opposed to output.'),
(37782, 'Incomer', 'n.', 'One who comes in.'),
(37783, 'Incomer', 'n.', 'One who succeeds another, as a tenant of land, houses,\n   etc.'),
(37784, 'Incoming', 'a.', 'Coming in; accruing.'),
(37785, 'Incoming', 'a.', 'Coming in, succeeding, or following, as occupant or\n   possessor; as, in incoming tenant.'),
(37786, 'Incoming', 'n.', 'The act of coming in; arrival.'),
(37787, 'Incoming', 'n.', 'Income; gain.'),
(37788, 'Incomity', 'n.', 'Want of comity; incivility; rudeness.'),
(37789, '-ties', 'pl. ', 'of Incompatibility'),
(37790, 'Incony', 'a.', 'Unlearned; artless; pretty; delicate.'),
(37791, 'Incorpse', 'v. t.', 'To incorporate.'),
(37792, 'Increase', 'v. i.', 'To become greater or more in size, quantity, number,\n   degree, value, intensity, power, authority, reputation, wealth; to\n   grow; to augment; to advance; -- opposed to decrease.'),
(37793, 'Increase', 'v. i.', 'To multiply by the production of young; to be fertile,\n   fruitful, or prolific.'),
(37794, 'Increase', 'v. i.', 'To become more nearly full; to show more of the\n   surface; to wax; as, the moon increases.'),
(37795, 'Increase', 'v. t.', 'To augment or make greater in bulk, quantity, extent,\n   value, or amount, etc.; to add to; to extend; to lengthen; to enhance;\n   to aggravate; as, to increase one\'s possessions, influence.'),
(37796, 'Increase', 'v. i.', 'Addition or enlargement in size, extent, quantity,\n   number, intensity, value, substance, etc.; augmentation; growth.'),
(37797, 'Increase', 'v. i.', 'That which is added to the original stock by\n   augmentation or growth; produce; profit; interest.'),
(37798, 'Increase', 'v. i.', 'Progeny; issue; offspring.'),
(37799, 'Increase', 'v. i.', 'Generation.'),
(37800, 'Increase', 'v. i.', 'The period of increasing light, or luminous phase; the\n   waxing; -- said of the moon.'),
(37801, 'Increate', 'v. t.', 'To create within.'),
(37802, 'Increate', 'a.', 'Alt. of Increated'),
(37803, 'Increst', 'v. t.', 'To adorn with a crest.'),
(37804, 'Incrust', 'v. t.', 'To cover or line with a crust, or hard coat; to form a\n   crust on the surface of; as, iron incrusted with rust; a vessel\n   incrusted with salt; a sweetmeat incrusted with sugar.'),
(37805, 'Incrust', 'v. t.', 'To inlay into, as a piece of carving or other\n   ornamental object.'),
(37806, 'Incubate', 'v. i. & t.', 'To sit, as on eggs for hatching; to brood; to\n   brood upon, or keep warm, as eggs, for the purpose of hatching.'),
(37807, 'Incube', 'v. t.', 'To fix firmly, as in cube; to secure or place firmly.'),
(37808, 'Incubous', 'a.', 'Having the leaves so placed that the upper part of each\n   one covers the base of the leaf next above it, as in hepatic mosses of\n   the genus Frullania. See Succubous.'),
(37809, 'Incubi', 'pl. ', 'of Incubus'),
(37810, 'Incubus', 'n.', 'A demon; a fiend; a lascivious spirit, supposed to have\n   sexual intercourse with women by night.'),
(37811, 'Incubus', 'n.', 'The nightmare. See Nightmare.'),
(37812, 'Incubus', 'n.', 'Any oppressive encumbrance or burden; anything that\n   prevents the free use of the faculties.'),
(37813, 'Inculk', 'v. t.', 'To inculcate.'),
(37814, 'Inculp', 'v. t.', 'To inculpate.'),
(37815, 'Incult', 'a.', 'Untilled; uncultivated; crude; rude; uncivilized.'),
(37816, 'Incumber', 'v. t.', 'See Encumber.'),
(37817, 'Incurred', 'imp. & p. p.', 'of Incur'),
(37818, 'Incur', 'v. t.', 'To meet or fall in with, as something inconvenient,\n   harmful, or onerous; to put one\'s self in the way of; to expose one\'s\n   self to; to become liable or subject to; to bring down upon one\'s self;\n   to encounter; to contract; as, to incur debt, danger, displeasure/\n   penalty, responsibility, etc.'),
(37819, 'Incur', 'v. t.', 'To render liable or subject to; to occasion.'),
(37820, 'Incur', 'v. i.', 'To pass; to enter.'),
(37821, 'Incurved', 'imp. & p. p.', 'of Incurve'),
(37822, 'Incurve', 'v. t.', 'To bend; to curve; to make crooked.'),
(37823, 'Incurved', 'a.', 'Bending gradually toward the axis or center, as branches\n   or petals.'),
(37824, 'Incus', 'n.', 'An anvil.'),
(37825, 'Incus', 'n.', 'One of the small bones in the tympanum of the ear; the anvil\n   bone. See Ear.'),
(37826, 'Incus', 'n.', 'The central portion of the armature of the pharynx in the\n   Rotifera.'),
(37827, 'Incuse', 'v. t.', 'Cut or stamped in, or hollowed out by engraving.'),
(37828, 'Incuse', 'v. t.', 'Alt. of Incuss'),
(37829, 'Incuss', 'v. t.', 'To form, or mold, by striking or stamping, as a coin or\n   medal.'),
(37830, 'Incute', 'v. t.', 'To strike or stamp in.'),
(37831, 'Incyst', 'v. t.', 'See Encyst.'),
(37832, 'Incysted', 'a.', 'See Encysted.'),
(37833, 'Indagate', 'v. t.', 'To seek or search out.'),
(37834, 'Indamage', 'v. t.', 'See Endamage.'),
(37835, 'Indart', 'v. t.', 'To pierce, as with a dart.'),
(37836, 'Indazol', 'n.', 'A nitrogenous compound, C7H6N2, analogous to indol, and\n   produced from a diazo derivative or cinnamic acid.'),
(37837, 'Indear', 'v. t.', 'See Endear.'),
(37838, 'Indebted', 'imp. & p. p.', 'of Indebt'),
(37839, 'Indebt', 'v. t.', 'To bring into debt; to place under obligation; --\n   chiefly used in the participle indebted.'),
(37840, 'Indebted', 'a.', 'Brought into debt; being under obligation; held to\n   payment or requital; beholden.'),
(37841, 'Indebted', 'a.', 'Placed under obligation for something received, for which\n   restitution or gratitude is due; as, we are indebted to our parents for\n   their care of us in infancy; indebted to friends for help and\n   encouragement.'),
(37842, 'Indecent', 'a.', 'Not decent; unfit to be seen or heard; offensive to\n   modesty and delicacy; as, indecent language.'),
(37843, 'Indeed', 'adv.', 'In reality; in truth; in fact; verily; truly; -- used in\n   a variety of sense. Esp.: (a) Denoting emphasis; as, indeed it is so.\n   (b) Denoting concession or admission; as, indeed, you are right. (c)\n   Denoting surprise; as, indeed, is it you? Its meaning is not intrinsic\n   or fixed, but depends largely on the form of expression which it\n   accompanies.'),
(37844, 'Indenize', 'v. t.', 'To naturalize.'),
(37845, 'Indented', 'imp. & p. p.', 'of Indent'),
(37846, 'Indent', 'v. t.', 'To notch; to jag; to cut into points like a row of\n   teeth; as, to indent the edge of paper.'),
(37847, 'Indent', 'v. t.', 'To dent; to stamp or to press in; to impress; as, indent\n   a smooth surface with a hammer; to indent wax with a stamp.'),
(37848, 'Indent', 'v. t.', 'To bind out by indenture or contract; to indenture; to\n   apprentice; as, to indent a young man to a shoemaker; to indent a\n   servant.'),
(37849, 'Indent', 'v. t.', 'To begin (a line or lines) at a greater or less distance\n   from the margin; as, to indent the first line of a paragraph one em; to\n   indent the second paragraph two ems more than the first. See\n   Indentation, and Indention.'),
(37850, 'Indent', 'v. t.', 'To make an order upon; to draw upon, as for military\n   stores.'),
(37851, 'Indent', 'v. i.', 'To be cut, notched, or dented.'),
(37852, 'Indent', 'v. i.', 'To crook or turn; to wind in and out; to zigzag.'),
(37853, 'Indent', 'v. i.', 'To contract; to bargain or covenant.'),
(37854, 'Indent', 'n.', 'A cut or notch in the man gin of anything, or a recess like\n   a notch.'),
(37855, 'Indent', 'n.', 'A stamp; an impression.'),
(37856, 'Indent', 'n.', 'A certificate, or intended certificate, issued by the\n   government of the United States at the close of the Revolution, for the\n   principal or interest of the public debt.'),
(37857, 'Indent', 'n.', 'A requisition or order for supplies, sent to the\n   commissariat of an army.'),
(37858, 'Indented', 'a.', 'Cut in the edge into points or inequalities, like teeth;\n   jagged; notched; stamped in; dented on the surface.'),
(37859, 'Indented', 'a.', 'Having an uneven, irregular border; sinuous; undulating.'),
(37860, 'Indented', 'a.', 'Notched like the part of a saw consisting of the teeth;\n   serrated; as, an indented border or ordinary.'),
(37861, 'Indented', 'a.', 'Bound out by an indenture; apprenticed; indentured; as,\n   an indented servant.'),
(37862, 'Indented', 'a.', 'Notched along the margin with a different color, as the\n   feathers of some birds.'),
(37863, 'Indesert', 'n.', 'Ill desert.'),
(37864, 'Indevote', 'a.', 'Not devoted.'),
(37865, 'Indevout', 'a.', 'Not devout.'),
(37866, 'Indew', 'v. t.', 'To indue.'),
(37867, 'Indexes', 'pl. ', 'of Index'),
(37868, 'Indices', 'pl. ', 'of Index'),
(37869, 'Index', 'n.', 'That which points out; that which shows, indicates,\n   manifests, or discloses.'),
(37870, 'Index', 'n.', 'That which guides, points out, informs, or directs; a\n   pointer or a hand that directs to anything, as the hand of a watch, a\n   movable finger on a gauge, scale, or other graduated instrument. In\n   printing, a sign used to direct particular attention to a note or\n   paragraph; -- called also fist.'),
(37871, 'Index', 'n.', 'A table for facilitating reference to topics, names, and the\n   like, in a book; -- usually alphabetical in arrangement, and printed at\n   the end of the volume.'),
(37872, 'Index', 'n.', 'A prologue indicating what follows.'),
(37873, 'Index', 'n.', 'The second digit, that next pollex, in the manus, or hand;\n   the forefinger; index finger.'),
(37874, 'Index', 'n.', 'The figure or letter which shows the power or root of a\n   quantity; the exponent.'),
(37875, 'indices', 'pl. ', 'of Index'),
(37876, 'Indexed', 'imp. & p. p.', 'of Index'),
(37877, 'Indexing', 'p. pr. & vb. n.', 'of Index'),
(37878, 'Index', 'v. t.', 'To provide with an index or table of references; to put\n   into an index; as, to index a book, or its contents.'),
(37879, 'Indexer', 'n.', 'One who makes an index.'),
(37880, 'India', 'n.', 'A country in Southern Asia; the two peninsulas of Hither and\n   Farther India; in a restricted sense, Hither India, or Hindostan.'),
(37881, 'Indiadem', 'v. t.', 'To place or set in a diadem, as a gem or gems.'),
(37882, 'Indiamen', 'pl. ', 'of Indiaman'),
(37883, 'Indiaman', 'n.', 'A large vessel in the India trade.'),
(37884, 'Indian', 'a.', 'Of or pertaining to India proper; also to the East Indies,\n   or, sometimes, to the West Indies.'),
(37885, 'Indian', 'a.', 'Of or pertaining to the aborigines, or Indians, of America;\n   as, Indian wars; the Indian tomahawk.'),
(37886, 'Indian', 'a.', 'Made of maize or Indian corn; as, Indian corn, Indian meal,\n   Indian bread, and the like.'),
(37887, 'Indian', 'n.', 'A native or inhabitant of India.'),
(37888, 'Indian', 'n.', 'One of the aboriginal inhabitants of America; -- so called\n   originally from the supposed identity of America with India.'),
(37889, 'Indical', 'a.', 'Indexical.'),
(37890, 'Indican', 'n.', 'A glucoside obtained from woad (indigo plant) and other\n   plants, as a yellow or light brown sirup. It has a nauseous bitter\n   taste, a decomposes or drying. By the action of acids, ferments, etc.,\n   it breaks down into sugar and indigo. It is the source of natural\n   indigo.'),
(37891, 'Indican', 'n.', 'An indigo-forming substance, found in urine, and other\n   animal fluids, and convertible into red and blue indigo (urrhodin and\n   uroglaucin). Chemically, it is indoxyl sulphate of potash, C8H6NSO4K,\n   and is derived from the indol formed in the alimentary canal. Called\n   also uroxanthin.'),
(37892, 'Indicant', 'a.', 'Serving to point out, as a remedy; indicating.'),
(37893, 'Indicant', 'n.', 'That which indicates or points out; as, an indicant of\n   the remedy for a disease.'),
(37894, 'Indicate', 'v. t.', 'To point out; to discover; to direct to a knowledge\n   of; to show; to make known.'),
(37895, 'Indicate', 'v. t.', 'To show or manifest by symptoms; to point to as the\n   proper remedies; as, great prostration of strength indicates the use of\n   stimulants.'),
(37896, 'Indicate', 'v. t.', 'To investigate the condition or power of, as of steam\n   engine, by means of an indicator.'),
(37897, 'Indice', 'n.', 'Index; indication.'),
(37898, 'Indices', 'n. pl.', 'See Index.'),
(37899, 'Indicia', 'n. pl.', 'Discriminating marks; signs; tokens; indications;\n   appearances.'),
(37900, 'Indicted', 'imp. & p. p.', 'of Indict'),
(37901, 'Indict', 'v. t.', 'To write; to compose; to dictate; to indite.'),
(37902, 'Indict', 'v. t.', 'To appoint publicly or by authority; to proclaim or\n   announce.'),
(37903, 'Indict', 'v. t.', 'To charge with a crime, in due form of law, by the\n   finding or presentment of a grand jury; to find an indictment against;\n   as, to indict a man for arson. It is the peculiar province of a grand\n   jury to indict, as it is of a house of representatives to impeach.'),
(37904, 'Indictee', 'n.', 'A person indicted.'),
(37905, 'Indicter', 'n.', 'One who indicts.'),
(37906, 'Indictor', 'n.', 'One who indicts.'),
(37907, 'Indies', 'n. pl.', 'A name designating the East Indies, also the West\n   Indies.'),
(37908, 'Indigeen', 'n.', 'Same as Indigene.'),
(37909, 'Indigene', 'n.', 'One born in a country; an aboriginal animal or plant; an\n   autochthon.'),
(37910, 'Indigent', 'a.', 'Wanting; void; free; destitute; -- used with of.'),
(37911, 'Indigent', 'a.', 'Destitute of property or means of comfortable\n   subsistence; needy; poor; in want; necessitous.'),
(37912, 'Indigest', 'a.', 'Crude; unformed; unorganized; undigested.'),
(37913, 'Indigest', 'n.', 'Something indigested.'),
(37914, 'Indign', 'a.', 'Unworthy; undeserving; disgraceful; degrading.'),
(37915, 'Indignly', 'adv.', 'Unworthily.'),
(37916, 'Indigoes', 'pl. ', 'of Indigo'),
(37917, 'Indigo', 'n.', 'A kind of deep blue, one of the seven prismatic colors.'),
(37918, 'Indigo', 'n.', 'A blue dyestuff obtained from several plants belonging to\n   very different genera and orders; as, the woad, Isatis tinctoria,\n   Indigofera tinctoria, I. Anil, Nereum tinctorium, etc. It is a dark\n   blue earthy substance, tasteless and odorless, with a copper-violet\n   luster when rubbed. Indigo does not exist in the plants as such, but is\n   obtained by decomposition of the glycoside indican.'),
(37919, 'Indigo', 'a.', 'Having the color of, pertaining to, or derived from,\n   indigo.'),
(37920, 'Indin', 'n.', 'A dark red crystalline substance, isomeric with and\n   resembling indigo blue, and obtained from isatide and dioxindol.'),
(37921, 'Indirect', 'a.', 'Not direct; not straight or rectilinear; deviating from a\n   direct line or course; circuitous; as, an indirect road.'),
(37922, 'Indirect', 'a.', 'Not tending to an aim, purpose, or result by the plainest\n   course, or by obvious means, but obliquely or consequentially; by\n   remote means; as, an indirect accusation, attack, answer, or proposal.'),
(37923, 'Indirect', 'a.', 'Not straightforward or upright; unfair; dishonest;\n   tending to mislead or deceive.'),
(37924, 'Indirect', 'a.', 'Not resulting directly from an act or cause, but more or\n   less remotely connected with or growing out of it; as, indirect\n   results, damages, or claims.'),
(37925, 'Indirect', 'a.', 'Not reaching the end aimed at by the most plain and\n   direct method; as, an indirect proof, demonstration, etc.'),
(37926, 'Inditch', 'v. t.', 'To bury in, or cast into, a ditch.'),
(37927, 'Indited', 'imp. & p. p.', 'of Indite'),
(37928, 'Inditing', 'p. pr. & vb. n.', 'of Indite'),
(37929, 'Indite', 'v. t.', 'To compose; to write; to be author of; to dictate; to\n   prompt.'),
(37930, 'Indite', 'v. t.', 'To invite or ask.'),
(37931, 'Indite', 'v. t.', 'To indict; to accuse; to censure.'),
(37932, 'Indite', 'v. i.', 'To compose; to write, as a poem.'),
(37933, 'Inditer', 'n.', 'One who indites.'),
(37934, 'Indium', 'n.', 'A rare metallic element, discovered in certain ores of\n   zinc, by means of its characteristic spectrum of two indigo blue lines;\n   hence, its name. In appearance it resembles zinc, being white or lead\n   gray, soft, malleable and easily fusible, but in its chemical relation\n   it resembles aluminium or gallium. Symbol In. Atomic weight, 113.4.'),
(37935, 'Indo-', '', 'A prefix signifying Indian (i. e., East Indian); of or\n   pertaining of India.'),
(37936, 'Indocile', 'a.', 'Not teachable; indisposed to be taught, trained, or\n   disciplined; not easily instructed or governed; dull; intractable.'),
(37937, 'Indogen', 'n.', 'A complex, nitrogenous radical, C8H5NO, regarded as the\n   essential nucleus of indigo.'),
(37938, 'Indoin', 'n.', 'A substance resembling indigo blue, obtained artificially\n   from certain isatogen compounds.'),
(37939, 'Indol', 'n.', 'A white, crystalline substance, C8H7N, obtained from blue\n   indigo, and almost all indigo derivatives, by a process of reduction.\n   It is also formed from albuminous matter, together with skatol, by\n   putrefaction, and by fusion with caustic potash, and is present in\n   human excrement, as well as in the intestinal canal of some herbivora.'),
(37940, 'Indolent', 'a.', 'Free from toil, pain, or trouble.'),
(37941, 'Indolent', 'a.', 'Indulging in ease; avoiding labor and exertion;\n   habitually idle; lazy; inactive; as, an indolent man.'),
(37942, 'Indolent', 'a.', 'Causing little or no pain or annoyance; as, an indolent\n   tumor.'),
(37943, 'Indoles', 'n.', 'Natural disposition; natural quality or abilities.'),
(37944, 'Indolin', 'n.', 'A dark resinous substance, polymeric with indol, and\n   obtained by the reduction of indigo white.'),
(37945, 'Indomite', 'a.', 'Not tamed; untamed; savage; wild.'),
(37946, 'Indoor', 'a.', 'Done or being within doors; within a house or institution;\n   domestic; as, indoor work.'),
(37947, 'Indoors', 'adv.', 'Within the house; -- usually separated, in doors.'),
(37948, 'Indorsed', 'imp. & p. p.', 'of Indorse'),
(37949, 'Indorse', 'v. t.', 'To cover the back of; to load or burden.'),
(37950, 'Indorse', 'v. t.', 'To write upon the back or outside of a paper or letter,\n   as a direction, heading, memorandum, or address.'),
(37951, 'Indorse', 'v. t.', 'To write one\'s name, alone or with other words, upon\n   the back of (a paper), for the purpose of transferring it, or to secure\n   the payment of a /ote, draft, or the like; to guarantee the payment,\n   fulfillment, performance, or validity of, or to certify something upon\n   the back of (a check, draft, writ, warrant of arrest, etc.).'),
(37952, 'Indorse', 'v. t.', 'To give one\'s name or support to; to sanction; to aid\n   by approval; to approve; as, to indorse an opinion.'),
(37953, 'Indorsed', 'a.', 'See Addorsed.'),
(37954, 'Indorsee', 'n.', 'The person to whom a note or bill is indorsed, or\n   assigned by indorsement.'),
(37955, 'Indorser', 'n.', 'Alt. of Indorsor'),
(37956, 'Indorsor', 'n.', 'The person who indorses.'),
(37957, 'Indow', 'v. t.', 'See Endow.'),
(37958, 'Indoxyl', 'n.', 'A nitrogenous substance, C8H7NO, isomeric with oxindol,\n   obtained as an oily liquid.'),
(37959, 'Indrawn', 'a.', 'Drawn in.'),
(37960, 'Indrench', 'v. t.', 'To overwhelm with water; to drench; to drown.'),
(37961, 'Indris', 'n.', 'Alt. of Indri'),
(37962, 'Indri', 'n.', 'Any lemurine animal of the genus Indris.'),
(37963, 'Induced', 'imp. & p. p.', 'of Induce'),
(37964, 'Inducing', 'p. pr. & vb. n.', 'of Induce'),
(37965, 'Induce', 'v. t.', 'To lead in; to introduce.'),
(37966, 'Induce', 'v. t.', 'To draw on; to overspread.'),
(37967, 'Induce', 'v. t.', 'To lead on; to influence; to prevail on; to incite; to\n   move by persuasion or influence.'),
(37968, 'Induce', 'v. t.', 'To bring on; to effect; to cause; as, a fever induced by\n   fatigue or exposure.'),
(37969, 'Induce', 'v. t.', 'To produce, or cause, by proximity without contact or\n   transmission, as a particular electric or magnetic condition in a body,\n   by the approach of another body in an opposite electric or magnetic\n   state.'),
(37970, 'Induce', 'v. t.', 'To generalize or conclude as an inference from all the\n   particulars; -- the opposite of deduce.'),
(37971, 'Inducer', 'n.', 'One who, or that which, induces or incites.'),
(37972, 'Inducted', 'imp. & p. p.', 'of Induct'),
(37973, 'Induct', 'v. t.', 'To bring in; to introduce; to usher in.'),
(37974, 'Induct', 'v. t.', 'To introduce, as to a benefice or office; to put in\n   actual possession of the temporal rights of an ecclesiastical living,\n   or of any other office, with the customary forms and ceremonies.'),
(37975, 'Inductor', 'n.', 'The person who inducts another into an office or\n   benefice.'),
(37976, 'Inductor', 'n.', 'That portion of an electrical apparatus, in which is the\n   inducing charge or current.'),
(37977, 'Indued', 'imp. & p. p.', 'of Indue'),
(37978, 'Induing', 'p. pr. & vb. n.', 'of Indue'),
(37979, 'Indue', 'v. t.', 'To put on, as clothes; to draw on.'),
(37980, 'Indue', 'v. t.', 'To clothe; to invest; hence, to endow; to furnish; to\n   supply with moral or mental qualities.'),
(37981, 'Indulged', 'imp. & p. p.', 'of Indulge'),
(37982, 'Indulge', 'v. t.', 'To be complacent toward; to give way to; not to oppose\n   or restrain'),
(37983, 'Indulge', 'v. t.', 'to give free course to; to give one\'s self up to; as,\n   to indulge sloth, pride, selfishness, or inclinations;'),
(37984, 'Indulge', 'v. t.', 'to yield to the desire of; to gratify by compliance; to\n   humor; to withhold restraint from; as, to indulge children in their\n   caprices or willfulness; to indulge one\'s self with a rest or in\n   pleasure.'),
(37985, 'Indulge', 'v. t.', 'To grant as by favor; to bestow in concession, or in\n   compliance with a wish or request.'),
(37986, 'Indulge', 'v. i.', 'To indulge one\'s self; to gratify one\'s tastes or\n   desires; esp., to give one\'s self up (to); to practice a forbidden or\n   questionable act without restraint; -- followed by in, but formerly,\n   also, by to.'),
(37987, 'Indulger', 'n.', 'One who indulges.'),
(37988, 'Induline', 'n.', 'Any one of a large series of aniline dyes, colored blue\n   or violet, and represented by aniline violet.'),
(37989, 'Induline', 'n.', 'A dark green amorphous dyestuff, produced by the\n   oxidation of aniline in the presence of copper or vanadium salts; --\n   called also aniline black.'),
(37990, 'Indult', 'n.', 'Alt. of Indulto'),
(37991, 'Indulto', 'n.', 'A privilege or exemption; an indulgence; a dispensation\n   granted by the pope.'),
(37992, 'Indulto', 'n.', 'A duty levied on all importations.'),
(37993, 'Indument', 'n.', 'Plumage; feathers.'),
(37994, 'Indurate', 'a.', 'Hardened; not soft; indurated.'),
(37995, 'Indurate', 'a.', 'Without sensibility; unfeeling; obdurate.'),
(37996, 'Indurate', 'v. t.', 'To make hard; as, extreme heat indurates clay; some\n   fossils are indurated by exposure to the air.'),
(37997, 'Indurate', 'v. t.', 'To make unfeeling; to deprive of sensibility; to\n   render obdurate.'),
(37998, 'Indurate', 'v. i.', 'To grow hard; to harden, or become hard; as, clay\n   indurates by drying, and by heat.'),
(37999, 'Indusial', 'a.', 'Of, pertaining to, or containing, the petrified cases of\n   the larvae of certain insects.'),
(38000, 'Indusia', 'pl. ', 'of Indusium'),
(38001, 'Indusium', 'n.', 'A collection of hairs united so as to form a sort of cup,\n   and inclosing the stigma of a flower.'),
(38002, 'Indusium', 'n.', 'The immediate covering of the fruit dots or sori in many\n   ferns, usually a very thin scale attached by the middle or side to a\n   veinlet.'),
(38003, 'Indusium', 'n.', 'A peculiar covering found in certain fungi.'),
(38004, 'Industry', 'n.', 'Habitual diligence in any employment or pursuit, either\n   bodily or mental; steady attention to business; assiduity; -- opposed\n   to sloth and idleness; as, industry pays debts, while idleness or\n   despair will increase them.'),
(38005, 'Industry', 'n.', 'Any department or branch of art, occupation, or business;\n   especially, one which employs much labor and capital and is a distinct\n   branch of trade; as, the sugar industry; the iron industry; the cotton\n   industry.'),
(38006, 'Industry', 'n.', 'Human exertion of any kind employed for the creation of\n   value, and regarded by some as a species of capital or wealth; labor.'),
(38007, 'Indutive', 'a.', 'Covered; -- applied to seeds which have the usual\n   integumentary covering.'),
(38008, 'Induviae', 'n. pl.', 'Persistent portions of a calyx or corolla; also,\n   leaves which do not disarticulate from the stem, and hence remain for a\n   long time.'),
(38009, 'Indwelt', 'imp. & p. p.', 'of Indwell'),
(38010, 'Indwell', 'v. t. & i.', 'To dwell in; to abide within; to remain in\n   possession.'),
(38011, 'Inearth', 'v. t.', 'To inter.'),
(38012, 'Inedited', 'a.', 'Not edited; unpublished; as, an inedited manuscript.'),
(38013, 'Inept', 'a.', 'Not apt or fit; unfit; unsuitable; improper; unbecoming.'),
(38014, 'Inept', 'a.', 'Silly; useless; nonsensical; absurd; foolish.'),
(38015, 'Ineptly', 'adv.', 'Unfitly; unsuitably; awkwardly.'),
(38016, 'Inequal', 'a.', 'Unequal; uneven; various.'),
(38017, 'Inequity', 'n.', 'Want of equity; injustice; wrong.'),
(38018, 'Inerm', 'a.', 'Alt. of Inermous'),
(38019, 'Inermous', 'a.', 'Same as Inermis.'),
(38020, 'Inermis', 'a.', 'Unarmed; destitute of prickles or thorns, as a leaf.'),
(38021, 'Inert', 'a.', 'Destitute of the power of moving itself, or of active\n   resistance to motion; as, matter is inert.'),
(38022, 'Inert', 'a.', 'Indisposed to move or act; very slow to act; sluggish; dull;\n   inactive; indolent; lifeless.'),
(38023, 'Inert', 'a.', 'Not having or manifesting active properties; not affecting\n   other substances when brought in contact with them; powerless for an\n   expected or desired effect.'),
(38024, 'Inertia', 'n.', 'That property of matter by which it tends when at rest to\n   remain so, and when in motion to continue in motion, and in the same\n   straight line or direction, unless acted on by some external force; --\n   sometimes called vis inertiae.'),
(38025, 'Inertia', 'n.', 'Inertness; indisposition to motion, exertion, or action;\n   want of energy; sluggishness.'),
(38026, 'Inertia', 'n.', 'Want of activity; sluggishness; -- said especially of the\n   uterus, when, in labor, its contractions have nearly or wholly ceased.'),
(38027, 'Inertion', 'n.', 'Want of activity or exertion; inertness; quietude.'),
(38028, 'Inertly', 'adv.', 'Without activity; sluggishly.'),
(38029, 'Inescate', 'v. t.', 'To allure; to lay a bait for.'),
(38030, 'In esse', '', 'In being; actually existing; -- distinguished from in posse,\n   or in potentia, which denote that a thing is not, but may be.'),
(38031, 'Inexact', 'a.', 'Not exact; not precisely correct or true; inaccurate.'),
(38032, 'Inexist', 'v. i.', 'To exist within; to dwell within.'),
(38033, 'Inexpert', 'a.', 'Destitute of experience or of much experience.'),
(38034, 'Inexpert', 'a.', 'Not expert; not skilled; destitute of knowledge or\n   dexterity derived from practice.'),
(38035, 'Ineyed', 'imp. & p. p.', 'of Ineye'),
(38036, 'Ineyeing', 'p. pr. & vb. n.', 'of Ineye'),
(38037, 'Ineye', 'v. t.', 'To ingraft, as a tree or plant, by the insertion of a bud\n   or eye; to inoculate.'),
(38038, 'Infame', 'v. t.', 'To defame; to make infamous.'),
(38039, 'Infamize', 'v. t.', 'To make infamous; to defame.'),
(38040, 'Infamous', 'a.', 'Of very bad report; having a reputation of the worst\n   kind; held in abhorrence; guilty of something that exposes to infamy;\n   base; notoriously vile; detestable; as, an infamous traitor; an\n   infamous perjurer.'),
(38041, 'Infamous', 'a.', 'Causing or producing infamy; deserving detestation;\n   scandalous to the last degree; as, an infamous act; infamous vices;\n   infamous corruption.'),
(38042, 'Infamous', 'a.', 'Branded with infamy by conviction of a crime; as, at\n   common law, an infamous person can not be a witness.'),
(38043, 'Infamous', 'a.', 'Having a bad name as being the place where an odious\n   crime was committed, or as being associated with something detestable;\n   hence, unlucky; perilous; dangerous.'),
(38044, 'Infamies', 'pl. ', 'of Infamy'),
(38045, 'Infamy', 'n.', 'Total loss of reputation; public disgrace; dishonor;\n   ignominy; indignity.'),
(38046, 'Infamy', 'n.', 'A quality which exposes to disgrace; extreme baseness or\n   vileness; as, the infamy of an action.'),
(38047, 'Infamy', 'n.', 'That loss of character, or public disgrace, which a convict\n   incurs, and by which he is at common law rendered incompetent as a\n   witness.'),
(38048, 'Infancy', 'n.', 'The state or period of being an infant; the first part of\n   life; early childhood.'),
(38049, 'Infancy', 'n.', 'The first age of anything; the beginning or early period\n   of existence; as, the infancy of an art.'),
(38050, 'Infancy', 'n.', 'The state or condition of one under age, or under the age\n   of twenty-one years; nonage; minority.'),
(38051, 'Infant', 'n.', 'A child in the first period of life, beginning at his\n   birth; a young babe; sometimes, a child several years of age.'),
(38052, 'Infant', 'n.', 'A person who is not of full age, or who has not attained\n   the age of legal capacity; a person under the age of twenty-one years;\n   a minor.'),
(38053, 'Infant', 'n.', 'Same as Infante.'),
(38054, 'Infant', 'a.', 'Of or pertaining to infancy, or the first period of life;\n   tender; not mature; as, infant strength.'),
(38055, 'Infant', 'a.', 'Intended for young children; as, an infant school.'),
(38056, 'Infant', 'v. t.', 'To bear or bring forth, as a child; hence, to produce,\n   in general.'),
(38057, 'Infanta', 'n.', 'A title borne by every one of the daughters of the kings\n   of Spain and Portugal, except the eldest.'),
(38058, 'Infante', 'n.', 'A title given to every one of sons of the kings of Spain\n   and Portugal, except the eldest or heir apparent.'),
(38059, 'Infantly', 'a.', 'Like an infant.'),
(38060, 'Infantry', 'n.', 'A body of children.'),
(38061, 'Infantry', 'n.', 'A body of soldiers serving on foot; foot soldiers, in\n   distinction from cavalry.'),
(38062, 'Infarce', 'v. t.', 'To stuff; to swell.'),
(38063, 'Infare', 'n.', 'A house-warming; especially, a reception, party, or\n   entertainment given by a newly married couple, or by the husband upon\n   receiving the wife to his house.'),
(38064, 'Infaust', 'a.', 'Not favorable; unlucky; unpropitious; sinister.'),
(38065, 'Infect', 'v. t.', 'Infected. Cf. Enfect.'),
(38066, 'Infected', 'imp. & p. p.', 'of Infect'),
(38067, 'Infect', 'v. t.', 'To taint with morbid matter or any pestilential or\n   noxious substance or effluvium by which disease is produced; as, to\n   infect a lancet; to infect an apartment.'),
(38068, 'Infect', 'v. t.', 'To affect with infectious disease; to communicate\n   infection to; as, infected with the plague.'),
(38069, 'Infect', 'v. t.', 'To communicate to or affect with, as qualities or\n   emotions, esp. bad qualities; to corrupt; to contaminate; to taint by\n   the communication of anything noxious or pernicious.'),
(38070, 'Infect', 'v. t.', 'To contaminate with illegality or to expose to penalty.'),
(38071, 'Infecter', 'n.', 'One who, or that which, infects.'),
(38072, 'Infecund', 'a.', 'Unfruitful; not producing young; barren; infertile.'),
(38073, 'Infeeble', 'v. t.', 'See Enfeeble.'),
(38074, 'Infelt', 'a.', 'Felt inwardly; heartfelt.'),
(38075, 'Infeoff', 'v. t.', 'See Enfeoff.'),
(38076, 'Inferred', 'imp. & p. p.', 'of Infer'),
(38077, 'Infer', 'v. t.', 'To bring on; to induce; to occasion.'),
(38078, 'Infer', 'v. t.', 'To offer, as violence.'),
(38079, 'Infer', 'v. t.', 'To bring forward, or employ as an argument; to adduce; to\n   allege; to offer.'),
(38080, 'Infer', 'v. t.', 'To derive by deduction or by induction; to conclude or\n   surmise from facts or premises; to accept or derive, as a consequence,\n   conclusion, or probability; to imply; as, I inferred his determination\n   from his silence.'),
(38081, 'Infer', 'v. t.', 'To show; to manifest; to prove.'),
(38082, 'Inferiae', 'n. pl.', 'Sacrifices offered to the souls of deceased heroes or\n   friends.'),
(38083, 'Inferior', 'a.', 'Lower in place, rank, excellence, etc.; less important or\n   valuable; subordinate; underneath; beneath.'),
(38084, 'Inferior', 'a.', 'Poor or mediocre; as, an inferior quality of goods.'),
(38085, 'Inferior', 'a.', 'Nearer the sun than the earth is; as, the inferior or\n   interior planets; an inferior conjunction of Mercury or Venus.'),
(38086, 'Inferior', 'a.', 'Below the horizon; as, the inferior part of a meridian.'),
(38087, 'Inferior', 'a.', 'Situated below some other organ; -- said of a calyx when\n   free from the ovary, and therefore below it, or of an ovary with an\n   adherent and therefore inferior calyx.'),
(38088, 'Inferior', 'a.', 'On the side of a flower which is next the bract;\n   anterior.'),
(38089, 'Inferior', 'a.', 'Junior or subordinate in rank; as, an inferior officer.'),
(38090, 'Inferior', 'n.', 'A person lower in station, rank, intellect, etc., than\n   another.'),
(38091, 'Infernal', 'a.', 'Of or pertaining to or suitable for the lower regions,\n   inhabited, according to the ancients, by the dead; pertaining to\n   Pluto\'s realm of the dead, the Tartarus of the ancients.'),
(38092, 'Infernal', 'a.', 'Of or pertaining to, resembling, or inhabiting, hell;\n   suitable for hell, or to the character of the inhabitants of hell;\n   hellish; diabolical; as, infernal spirits, or conduct.'),
(38093, 'Infernal', 'n.', 'An inhabitant of the infernal regions; also, the place\n   itself.'),
(38094, 'Infest', 'v. t.', 'Mischievous; hurtful; harassing.'),
(38095, 'Infested', 'imp. & p. p.', 'of Infest'),
(38096, 'Infest', 'v. t.', 'To trouble greatly by numbers or by frequency of\n   presence; to disturb; to annoy; to frequent and molest or harass; as,\n   fleas infest dogs and cats; a sea infested with pirates.'),
(38097, 'Infester', 'n.', 'One who, or that which, infests.'),
(38098, 'Infidel', 'a.', 'Not holding the faith; -- applied esp. to one who does not\n   believe in the inspiration of the Scriptures, and the supernatural\n   origin of Christianity.'),
(38099, 'Infidel', 'n.', 'One who does not believe in the prevailing religious\n   faith; especially, one who does not believe in the divine origin and\n   authority of Christianity; a Mohammedan; a heathen; a freethinker.'),
(38100, 'Infield', 'v. t.', 'To inclose, as a field.'),
(38101, 'Infield', 'n.', 'Arable and manured land kept continually under crop; --\n   distinguished from outfield.'),
(38102, 'Infield', 'n.', 'The diamond; -- opposed to outfield. See Diamond, n., 5.'),
(38103, 'Infile', 'v. t.', 'To arrange in a file or rank; to place in order.'),
(38104, 'Infilm', 'v. t.', 'To cover with a film; to coat thinly; as, to infilm one\n   metal with another in the process of gilding; to infilm the glass of a\n   mirror.'),
(38105, 'Infilter', 'v. t. & i.', 'To filter or sift in.'),
(38106, 'Infinite', 'a.', 'Unlimited or boundless, in time or space; as, infinite\n   duration or distance.'),
(38107, 'Infinite', 'a.', 'Without limit in power, capacity, knowledge, or\n   excellence; boundless; immeasurably or inconceivably great; perfect;\n   as, the infinite wisdom and goodness of God; -- opposed to finite.'),
(38108, 'Infinite', 'a.', 'Indefinitely large or extensive; great; vast; immense;\n   gigantic; prodigious.'),
(38109, 'Infinite', 'a.', 'Greater than any assignable quantity of the same kind; --\n   said of certain quantities.'),
(38110, 'Infinite', 'a.', 'Capable of endless repetition; -- said of certain forms\n   of the canon, called also perpetual fugues, so constructed that their\n   ends lead to their beginnings, and the performance may be incessantly\n   repeated.'),
(38111, 'Infinite', 'n.', 'That which is infinite; boundless space or duration;\n   infinity; boundlessness.'),
(38112, 'Infinite', 'n.', 'An infinite quantity or magnitude.'),
(38113, 'Infinite', 'n.', 'An infinity; an incalculable or very great number.'),
(38114, 'Infinite', 'n.', 'The Infinite Being; God; the Almighty.'),
(38115, 'Infinito', 'a.', 'Infinite; perpetual, as a canon whose end leads back to\n   the beginning. See Infinite, a., 5.'),
(38116, 'Infinity', 'n.', 'Unlimited extent of time, space, or quantity; eternity;\n   boundlessness; immensity.'),
(38117, 'Infinity', 'n.', 'Unlimited capacity, energy, excellence, or knowledge; as,\n   the infinity of God and his perfections.'),
(38118, 'Infinity', 'n.', 'Endless or indefinite number; great multitude; as an\n   infinity of beauties.'),
(38119, 'Infinity', 'n.', 'A quantity greater than any assignable quantity of the\n   same kind.'),
(38120, 'Infinity', 'n.', 'That part of a line, or of a plane, or of space, which is\n   infinitely distant. In modern geometry, parallel lines or planes are\n   sometimes treated as lines or planes meeting at infinity.'),
(38121, 'Infirm', 'a.', 'Not firm or sound; weak; feeble; as, an infirm body; an\n   infirm constitution.'),
(38122, 'Infirm', 'a.', 'Weak of mind or will; irresolute; vacillating.'),
(38123, 'Infirm', 'a.', 'Not solid or stable; insecure; precarious.'),
(38124, 'Infirm', 'v. t.', 'To weaken; to enfeeble.'),
(38125, 'Infirmly', 'adv.', 'In an infirm manner.'),
(38126, 'Infixed', 'imp. & p. p.', 'of Infix'),
(38127, 'Infixing', 'p. pr. & vb. n.', 'of Infix'),
(38128, 'Infix', 'v. t.', 'To set; to fasten or fix by piercing or thrusting in; as,\n   to infix a sting, spear, or dart.'),
(38129, 'Infix', 'v. t.', 'To implant or fix; to instill; to inculcate, as\n   principles, thoughts, or instructions; as, to infix good principles in\n   the mind, or ideas in the memory.'),
(38130, 'Infix', 'n.', 'Something infixed.'),
(38131, 'Inflamed', 'imp. & p. p.', 'of Inflame'),
(38132, 'Inflame', 'v. t.', 'To set on fire; to kindle; to cause to burn, flame, or\n   glow.'),
(38133, 'Inflame', 'v. t.', 'Fig.: To kindle or intensify, as passion or appetite;\n   to excite to an excessive or unnatural action or heat; as, to inflame\n   desire.'),
(38134, 'Inflame', 'v. t.', 'To provoke to anger or rage; to exasperate; to\n   irritate; to incense; to enrage.'),
(38135, 'Inflame', 'v. t.', 'To put in a state of inflammation; to produce morbid\n   heat, congestion, or swelling, of; as, to inflame the eyes by overwork.'),
(38136, 'Inflame', 'v. t.', 'To exaggerate; to enlarge upon.'),
(38137, 'Inflame', 'v. i.', 'To grow morbidly hot, congested, or painful; to become\n   angry or incensed.'),
(38138, 'Inflamed', 'p. a.', 'Set on fire; enkindled; heated; congested; provoked;\n   exasperated.'),
(38139, 'Inflamed', 'p. a.', 'Represented as burning, or as adorned with tongues of\n   flame.'),
(38140, 'Inflamer', 'n.', 'The person or thing that inflames.'),
(38141, 'Inflate', 'p. a.', 'Blown in; inflated.'),
(38142, 'Inflated', 'imp. & p. p.', 'of Inflate'),
(38143, 'Inflate', 'v. t.', 'To swell or distend with air or gas; to dilate; to\n   expand; to enlarge; as, to inflate a bladder; to inflate the lungs.'),
(38144, 'Inflate', 'v. t.', 'Fig.: To swell; to puff up; to elate; as, to inflate\n   one with pride or vanity.'),
(38145, 'Inflate', 'v. t.', 'To cause to become unduly expanded or increased; as, to\n   inflate the currency.'),
(38146, 'Inflate', 'v. i.', 'To expand; to fill; to distend.'),
(38147, 'Inflated', 'a.', 'Filled, as with air or gas; blown up; distended; as, a\n   balloon inflated with gas.'),
(38148, 'Inflated', 'a.', 'Turgid; swelling; puffed up; bombastic; pompous; as, an\n   inflated style.'),
(38149, 'Inflated', 'a.', 'Hollow and distended, as a perianth, corolla, nectary, or\n   pericarp.'),
(38150, 'Inflated', 'a.', 'Distended or enlarged fictitiously; as, inflated prices,\n   etc.'),
(38151, 'Inflater', 'n.', 'One who, or that which, inflates; as, the inflaters of\n   the stock exchange.'),
(38152, 'Inflatus', 'v. t.', 'A blowing or breathing into; inflation; inspiration.'),
(38153, 'Inflect', 'v. t.', 'To turn from a direct line or course; to bend; to\n   incline, to deflect; to curve; to bow.'),
(38154, 'Inflect', 'v. t.', 'To vary, as a noun or a verb in its terminations; to\n   decline, as a noun or adjective, or to conjugate, as a verb.'),
(38155, 'Inflect', 'v. t.', 'To modulate, as the voice.'),
(38156, 'Inflesh', 'v. t.', 'To incarnate.'),
(38157, 'Inflex', 'v. t.', 'To bend; to cause to become curved; to make crooked; to\n   deflect.'),
(38158, 'Inflexed', 'a.', 'Turned; bent.'),
(38159, 'Inflexed', 'a.', 'Bent or turned abruptly inwards, or toward the axis, as\n   the petals of a flower.'),
(38160, 'Inflict', 'v. t.', 'To give, cause, or produce by striking, or as if by\n   striking; to apply forcibly; to lay or impose; to send; to cause to\n   bear, feel, or suffer; as, to inflict blows; to inflict a wound with a\n   dagger; to inflict severe pain by ingratitude; to inflict punishment on\n   an offender; to inflict the penalty of death on a criminal.'),
(38161, 'Inflow', 'v. i.', 'To flow in.'),
(38162, 'Influent', 'a.', 'Flowing in.'),
(38163, 'Influent', 'a.', 'Exerting influence; influential.'),
(38164, 'Influx', 'n.', 'The act of flowing in; as, an influx of light.'),
(38165, 'Influx', 'n.', 'A coming in; infusion; intromission; introduction;\n   importation in abundance; also, that which flows or comes in; as, a\n   great influx of goods into a country, or an influx of gold and silver.'),
(38166, 'Influx', 'n.', 'Influence; power.'),
(38167, 'Infolded', 'imp. & p. p.', 'of Infold'),
(38168, 'Infold', 'v. t.', 'To wrap up or cover with folds; to envelop; to inwrap;\n   to inclose; to involve.'),
(38169, 'Infold', 'v. t.', 'To clasp with the arms; to embrace.'),
(38170, 'Inform', 'a.', 'Without regular form; shapeless; ugly; deformed.'),
(38171, 'Informed', 'imp. & p. p.', 'of Inform'),
(38172, 'Inform', 'v. t.', 'To give form or share to; to give vital ororganizing\n   power to; to give life to; to imbue and actuate with vitality; to\n   animate; to mold; to figure; to fashion.'),
(38173, 'Inform', 'v. t.', 'To communicate knowledge to; to make known to; to\n   acquaint; to advise; to instruct; to tell; to notify; to enlighten; --\n   usually followed by of.'),
(38174, 'Inform', 'v. t.', 'To communicate a knowledge of facts to,by way of\n   accusation; to warn against anybody.'),
(38175, 'Inform', 'v. t.', 'To take form; to become visible or manifest; to appear.'),
(38176, 'Inform', 'v. t.', 'To give intelligence or information; to tell.'),
(38177, 'Informal', 'a.', 'Not in the regular, usual, or established form; not\n   according to official, conventional, prescribed, or customary forms or\n   rules; irregular; hence, without ceremony; as, an informal writting,\n   proceeding, or visit.'),
(38178, 'Informal', 'a.', 'Deranged in mind; out of one\'s senses.');
INSERT INTO `entries` (`SN`, `word`, `wordtype`, `definition`) VALUES
(38179, 'Informed', 'a.', 'Unformed or ill-formed; deformed; shapeless.'),
(38180, 'Informer', 'v.', 'One who informs, animates, or inspires.'),
(38181, 'Informer', 'v.', 'One who informs, or imparts knowledge or news.'),
(38182, 'Informer', 'v.', 'One who informs a magistrate of violations of law; one\n   who informs against another for violation of some law or penal statute.'),
(38183, 'Infound', 'v. t.', 'To pour in; to infuse.'),
(38184, 'Infra', 'adv.', 'Below; beneath; under; after; -- often used as a prefix.'),
(38185, 'Infract', 'a.', 'Not broken or fractured; unharmed; whole.'),
(38186, 'Infract', 'v. t.', 'To break; to infringe.'),
(38187, 'Infringe', 'v. t.', 'To break; to violate; to transgress; to neglect to\n   fulfill or obey; as, to infringe a law or contract.'),
(38188, 'Infringe', 'v. t.', 'To hinder; to destroy; as, to infringe efficacy; to\n   infringe delight or power.'),
(38189, 'Infringe', 'v. i.', 'To break, violate, or transgress some contract, rule,\n   or law; to injure; to offend.'),
(38190, 'Infringe', 'v. i.', 'To encroach; to trespass; -- followed by on or upon;\n   as, to infringe upon the rights of another.'),
(38191, 'Infrugal', 'a.', 'Not frugal; wasteful; as, an infrugal expense of time.'),
(38192, 'Infucate', 'v. t.', 'To stain; to paint; to daub.'),
(38193, 'Infule', 'pl. ', 'of Infula'),
(38194, 'Infula', 'n.', 'A sort of fillet worn by dignitaries, priests, and others\n   among the ancient Romans. It was generally white.'),
(38195, 'Infumate', 'v. t.', 'To dry by exposing to smoke; to expose to smoke.'),
(38196, 'Infumed', 'a.', 'Dried in smoke; smoked.'),
(38197, 'Infused', 'imp. & p. p.', 'of Infuse'),
(38198, 'Infusing', 'p. pr. & vb. n.', 'of Infuse'),
(38199, 'Infuse', 'v. t.', 'To pour in, as a liquid; to pour (into or upon); to\n   shed.'),
(38200, 'Infuse', 'v. t.', 'To instill, as principles or qualities; to introduce.'),
(38201, 'Infuse', 'v. t.', 'To inspire; to inspirit or animate; to fill; -- followed\n   by with.'),
(38202, 'Infuse', 'v. t.', 'To steep in water or other fluid without boiling, for\n   the propose of extracting medicinal qualities; to soak.'),
(38203, 'Infuse', 'v. t.', 'To make an infusion with, as an ingredient; to tincture;\n   to saturate.'),
(38204, 'Infuse', 'n.', 'Infusion.'),
(38205, 'Infuser', 'n.', 'One who, or that which, infuses.'),
(38206, 'Infusion', 'v. t.', 'The act of infusing, pouring in, or instilling;\n   instillation; as, the infusion of good principles into the mind; the\n   infusion of ardor or zeal.'),
(38207, 'Infusion', 'v. t.', 'That which is infused; suggestion; inspiration.'),
(38208, 'Infusion', 'v. t.', 'The act of plunging or dipping into a fluid;\n   immersion.'),
(38209, 'Infusion', 'v. t.', 'The act or process of steeping or soaking any\n   substance in water in order to extract its virtues.'),
(38210, 'Infusion', 'v. t.', 'The liquid extract obtained by this process.'),
(38211, 'Infusive', 'a.', 'Having the power of infusion; inspiring; influencing.'),
(38212, 'Infusory', 'a.', 'Infusorial.'),
(38213, 'Infusory', 'n.', 'One of the Infusoria; -- usually in the pl.'),
(38214, 'Ingate', 'n.', 'Entrance; ingress.'),
(38215, 'Ingate', 'n.', 'The aperture in a mold for pouring in the metal; the gate.'),
(38216, 'Ingena', 'n.', 'The gorilla.'),
(38217, 'Ingender', 'v. t.', 'See Engender.'),
(38218, 'Ingenie', 'n.', 'See Ingeny.'),
(38219, 'Ingenite', 'a.', 'Alt. of Ingenit'),
(38220, 'Ingenit', 'a.', 'Innate; inborn; inbred; inherent; native; ingenerate.'),
(38221, 'Ingeny', 'n.', 'Natural gift or talent; ability; wit; ingenuity.'),
(38222, 'Ingest', 'v. t.', 'To take into, or as into, the stomach or alimentary\n   canal.'),
(38223, 'Ingesta', 'n. pl.', 'That which is introduced into the body by the stomach\n   or alimentary canal; -- opposed to egesta.'),
(38224, 'Inghalla', 'n.', 'The reedbuck of South Africa.'),
(38225, 'Ingirt', 'v. t.', 'To encircle to gird; to engirt.'),
(38226, 'Ingirt', 'a.', 'Surrounded; encircled.'),
(38227, 'Ingle', 'n.', 'Flame; blaze; a fire; a fireplace.'),
(38228, 'Ingle', 'n.', 'A paramour; a favourite; a sweetheart; an engle.'),
(38229, 'Ingle', 'v. t.', 'To cajole or coax; to wheedle. See Engle.'),
(38230, 'Inglobe', 'v. t.', 'To infix, as in a globe; to fix or secure firmly.'),
(38231, 'Inglut', 'v. t.', 'To glut.'),
(38232, 'In-going', 'n.', 'The act of going in; entrance.'),
(38233, 'In-going', 'a.', 'Going; entering, as upon an office or a possession; as,\n   an in-going tenant.'),
(38234, 'Ingorge', 'v. t. & i.', 'See Engorge.'),
(38235, 'Ingot', 'n.', 'That in which metal is cast; a mold.'),
(38236, 'Ingot', 'n.', 'A bar or wedge of steel, gold, or other malleable metal,\n   cast in a mold; a mass of unwrought cast metal.'),
(38237, 'Ingrace', 'v. t.', 'To ingratiate.'),
(38238, 'Ingraff', 'v. t.', 'See Ingraft.'),
(38239, 'Ingraft', 'v. t.', 'To insert, as a scion of one tree, shrub, or plant in\n   another for propagation; as, to ingraft a peach scion on a plum tree;\n   figuratively, to insert or introduce in such a way as to make a part of\n   something.'),
(38240, 'Ingraft', 'v. t.', 'To subject to the process of grafting; to furnish with\n   grafts or scions; to graft; as, to ingraft a tree.'),
(38241, 'Ingrain', 'a.', 'Dyed with grain, or kermes.'),
(38242, 'Ingrain', 'a.', 'Dyed before manufacture, -- said of the material of a\n   textile fabric; hence, in general, thoroughly inwrought; forming an\n   essential part of the substance.'),
(38243, 'Ingrain', 'n.', 'An ingrain fabric, as a carpet.'),
(38244, 'Ingrain', 'v. t.', 'To dye with or in grain or kermes.'),
(38245, 'Ingrain', 'v. t.', 'To dye in the grain, or before manufacture.'),
(38246, 'Ingrain', 'v. t.', 'To work into the natural texture or into the mental or\n   moral constitution of; to stain; to saturate; to imbue; to infix\n   deeply.'),
(38247, 'Ingrate', 'a.', 'Ingrateful.'),
(38248, 'Ingrate', 'n.', 'An ungrateful person.'),
(38249, 'Ingrave', 'v. t.', 'To engrave.'),
(38250, 'Ingrave', 'v. t.', 'To bury.'),
(38251, 'Ingreat', 'v. t.', 'To make great; to enlarge; to magnify.'),
(38252, 'Ingress', 'n.', 'The act of entering; entrance; as, the ingress of air into\n   the lungs.'),
(38253, 'Ingress', 'n.', 'Power or liberty of entrance or access; means of entering;\n   as, all ingress was prohibited.'),
(38254, 'Ingress', 'n.', 'The entrance of the moon into the shadow of the earth in\n   eclipses, the sun\'s entrance into a sign, etc.'),
(38255, 'Ingress', 'v. i.', 'To go in; to enter.'),
(38256, 'Ingrieve', 'v. t.', 'To render more grievous; to aggravate.'),
(38257, 'Ingroove', 'v. t.', 'To groove in; to join in or with a groove.'),
(38258, 'Ingross', 'v. t.', 'See Engross.'),
(38259, 'Ingrowth', 'n.', 'A growth or development inward.'),
(38260, 'Inguen', 'n.', 'The groin.'),
(38261, 'Inguilty', 'a.', 'Not guilty.'),
(38262, 'Inguinal', 'a.', 'Of or pertaining to, or in the region of, the inguen or\n   groin; as, an inguinal canal or ligament; inguinal hernia.'),
(38263, 'Ingulfed', 'imp. & p. p.', 'of Ingulf'),
(38264, 'Ingulf', 'v. t.', 'To swallow up or overwhelm in, or as in, a gulf; to cast\n   into a gulf. See Engulf.'),
(38265, 'Inhabile', 'a.', 'Not apt or fit; unfit; not convenient; inappropriate;\n   unsuitable; as, inhabile matter.'),
(38266, 'Inhabile', 'a.', 'Unskilled; unready; awkward; incompetent; unqualified; --\n   said of person.'),
(38267, 'Inhabit', 'v. t.', 'To live or dwell in; to occupy, as a place of settled\n   residence; as, wild beasts inhabit the forest; men inhabit cities and\n   houses.'),
(38268, 'Inhabit', 'v. i.', 'To have residence in a place; to dwell; to live; to\n   abide.'),
(38269, 'Inhalant', 'a.', 'Inhaling; used for inhaling.'),
(38270, 'Inhalant', 'n.', 'An apparatus also called an inhaler (which see); that\n   which is to be inhaled.'),
(38271, 'Inhaled', 'imp. & p. p.', 'of Inhale'),
(38272, 'Inhaling', 'p. pr. & vb. n.', 'of Inhale'),
(38273, 'Inhale', 'v. t.', 'To breathe or draw into the lungs; to inspire; as, to\n   inhale air; -- opposed to exhale.'),
(38274, 'Inhalent', 'a.', 'Used for inhaling; as, the inhalent end of a duct.'),
(38275, 'Inhaler', 'n.', 'One who inhales.'),
(38276, 'Inhaler', 'n.', 'An apparatus for inhaling any vapor or volatile substance,\n   as ether or chloroform, for medicinal purposes.'),
(38277, 'Inhaler', 'n.', 'A contrivance to filter, as air, in order to protect the\n   lungs from inhaling damp or cold air, noxious gases, dust, etc.; also,\n   the respiratory apparatus for divers.'),
(38278, 'Inhance', 'v. t.', 'See Enhance.'),
(38279, 'Inhaul', 'n.', 'Alt. of Inhauler'),
(38280, 'Inhauler', 'n.', 'A rope used to draw in the jib boom, or flying jib boom.'),
(38281, 'Inhearse', 'v. t.', 'To put in, or as in, a hearse or coffin.'),
(38282, 'Inhered', 'imp. & p. p.', 'of Inhere'),
(38283, 'Inhering', 'p. pr. & vb. n.', 'of Inhere'),
(38284, 'Inhere', 'v. i.', 'To be inherent; to stick (in); to be fixed or\n   permanently incorporated with something; to cleave (to); to belong, as\n   attributes or qualities.'),
(38285, 'Inherent', 'a.', 'Permanently existing in something; inseparably attached\n   or connected; naturally pertaining to; innate; inalienable; as,\n   polarity is an inherent quality of the magnet; the inherent right of\n   men to life, liberty, and protection.'),
(38286, 'Inherit', 'v. t.', 'To take by descent from an ancestor; to take by\n   inheritance; to take as heir on the death of an ancestor or other\n   person to whose estate one succeeds; to receive as a right or title\n   descendible by law from an ancestor at his decease; as, the heir\n   inherits the land or real estate of his father; the eldest son of a\n   nobleman inherits his father\'s title; the eldest son of a king inherits\n   the crown.'),
(38287, 'Inherit', 'v. t.', 'To receive or take by birth; to have by nature; to\n   derive or acquire from ancestors, as mental or physical qualities; as,\n   he inherits a strong constitution, a tendency to disease, etc.'),
(38288, 'Inherit', 'v. t.', 'To come into possession of; to possess; to own; to\n   enjoy as a possession.'),
(38289, 'Inherit', 'v. t.', 'To put in possession of.'),
(38290, 'Inherit', 'v. i.', 'To take or hold a possession, property, estate, or\n   rights by inheritance.'),
(38291, 'Inherse', 'v. t.', 'See Inhearse.'),
(38292, 'Inhesion', 'n.', 'The state of existing, of being inherent, in something;\n   inherence.'),
(38293, 'Inhibit', 'v. t.', 'To check; to hold back; to restrain; to hinder.'),
(38294, 'Inhibit', 'v. t.', 'To forbid; to prohibit; to interdict.'),
(38295, 'Inhive', 'v. t.', 'To place in a hive; to hive.'),
(38296, 'Inheld', 'imp. & p. p.', 'of Inhold'),
(38297, 'Inhold', 'v. t.', 'To have inherent; to contain in itself; to possess.'),
(38298, 'Inholder', 'n.', 'An inhabitant.'),
(38299, 'Inhoop', 'v. t.', 'To inclose in a hoop, or as in a hoop.'),
(38300, 'Inhuman', 'a.', 'Destitute of the kindness and tenderness that belong to a\n   human being; cruel; barbarous; savage; unfeeling; as, an inhuman person\n   or people.'),
(38301, 'Inhuman', 'a.', 'Characterized by, or attended with, cruelty; as, an\n   inhuman act or punishment.'),
(38302, 'Inhumate', 'v. t.', 'To inhume; to bury; to inter.'),
(38303, 'Inhumed', 'imp. & p. p.', 'of Inhume'),
(38304, 'Inhuming', 'p. pr. & vb. n.', 'of Inhume'),
(38305, 'Inhume', 'v. t.', 'To deposit, as a dead body, in the earth; to bury; to\n   inter.'),
(38306, 'Inhume', 'v. t.', 'To bury or place in warm earth for chemical or medicinal\n   purposes.'),
(38307, 'Inial', 'a.', 'Pertaining to the inion.'),
(38308, 'Inimical', 'a.', 'Having the disposition or temper of an enemy; unfriendly;\n   unfavorable; -- chiefly applied to private, as hostile is to public,\n   enmity.'),
(38309, 'Inimical', 'a.', 'Opposed in tendency, influence, or effects; antagonistic;\n   inconsistent; incompatible; adverse; repugnant.'),
(38310, 'Inion', 'n.', 'The external occipital protuberance of the skull.'),
(38311, 'Iniquity', 'n.', 'Absence of, or deviation from, just dealing; want of\n   rectitude or uprightness; gross injustice; unrighteousness; wickedness;\n   as, the iniquity of bribery; the iniquity of an unjust judge.'),
(38312, 'Iniquity', 'n.', 'An iniquitous act or thing; a deed of injustice o/\n   unrighteousness; a sin; a crime.'),
(38313, 'Iniquity', 'n.', 'A character or personification in the old English\n   moralities, or moral dramas, having the name sometimes of one vice and\n   sometimes of another. See Vice.'),
(38314, 'Iniquous', 'a.', 'Iniquitous.'),
(38315, 'Inisle', 'v. t.', 'To form into an island; to surround.'),
(38316, 'Initial', 'a.', 'Of or pertaining to the beginning; marking the\n   commencement; incipient; commencing; as, the initial symptoms of a\n   disease.'),
(38317, 'Initial', 'a.', 'Placed at the beginning; standing at the head, as of a\n   list or series; as, the initial letters of a name.'),
(38318, 'Initial', 'n.', 'The first letter of a word or a name.'),
(38319, 'Initial', 'v. t.', 'To put an initial to; to mark with an initial of\n   initials.'),
(38320, 'Initiate', 'v. t.', 'To introduce by a first act; to make a beginning with;\n   to set afoot; to originate; to commence; to begin or enter upon.'),
(38321, 'Initiate', 'v. t.', 'To acquaint with the beginnings; to instruct in the\n   rudiments or principles; to introduce.'),
(38322, 'Initiate', 'v. t.', 'To introduce into a society or organization; to confer\n   membership on; especially, to admit to a secret order with mysterious\n   rites or ceremonies.'),
(38323, 'Initiate', 'v. i.', 'To do the first act; to perform the first rite; to\n   take the initiative.'),
(38324, 'Initiate', 'a.', 'Unpracticed; untried; new.'),
(38325, 'Initiate', 'a.', 'Begun; commenced; introduced to, or instructed in, the\n   rudiments; newly admitted.'),
(38326, 'Initiate', 'n.', 'One who is, or is to be, initiated.'),
(38327, 'Inition', 'n.', 'Initiation; beginning.'),
(38328, 'Injected', 'imp. & p. p.', 'of Inject'),
(38329, 'Inject', 'v. t.', 'To throw in; to dart in; to force in; as, to inject cold\n   water into a condenser; to inject a medicinal liquid into a cavity of\n   the body; to inject morphine with a hypodermic syringe.'),
(38330, 'Inject', 'v. t.', 'Fig.: To throw; to offer; to propose; to instill.'),
(38331, 'Inject', 'v. t.', 'To cast or throw; -- with on.'),
(38332, 'Inject', 'v. t.', 'To fill (a vessel, cavity, or tissue) with a fluid or\n   other substance; as, to inject the blood vessels.'),
(38333, 'Injector', 'n.', 'One who, or that which, injects.'),
(38334, 'Injector', 'n.', 'A contrivance for forcing feed water into a steam boiler\n   by the direct action of the steam upon the water. The water is driven\n   into the boiler by the impulse of a jet of the steam which becomes\n   condensed as soon as it strikes the stream of cold water it impels; --\n   also called Giffard\'s injector, from the inventor.'),
(38335, 'Injelly', 'v. t.', 'To place in jelly.'),
(38336, 'Injoin', 'v. t.', 'See Enjoin.'),
(38337, 'Injoint', 'v. t.', 'To join; to unite.'),
(38338, 'Injoint', 'v. t.', 'To disjoint; to separate.'),
(38339, 'Injured', 'imp. & p. p.', 'of Injure'),
(38340, 'Injuring', 'p. pr. & vb. n.', 'of Injure'),
(38341, 'Injure', 'v. t.', 'To do harm to; to impair the excellence and value of; to\n   hurt; to damage; -- used in a variety of senses; as: (a) To hurt or\n   wound, as the person; to impair soundness, as of health. (b) To damage\n   or lessen the value of, as goods or estate. (c) To slander, tarnish, or\n   impair, as reputation or character. (d) To impair or diminish, as\n   happiness or virtue. (e) To give pain to, as the sensibilities or the\n   feelings; to grieve; to annoy. (f) To impair, as the intellect or mind.'),
(38342, 'Injurer', 'n.', 'One who injures or wrongs.'),
(38343, 'Injurie', 'pl. ', 'of Injuria'),
(38344, 'Injuria', 'n.', 'Injury; invasion of another\'s rights.'),
(38345, 'Injuries', 'pl. ', 'of Injury'),
(38346, 'Injury', 'a.', 'Any damage or violation of, the person, character,\n   feelings, rights, property, or interests of an individual; that which\n   injures, or occasions wrong, loss, damage, or detriment; harm; hurt;\n   loss; mischief; wrong; evil; as, his health was impaired by a severe\n   injury; slander is an injury to the character.'),
(38347, 'Inked', 'imp. & p. p.', 'of Ink'),
(38348, 'Inking', 'p. pr. & vb. n.', 'of Ink'),
(38349, 'Inker', 'n.', 'One who, or that which, inks; especially, in printing, the\n   pad or roller which inks the type.'),
(38350, 'Inkfish', 'n.', 'A cuttlefish. See Cuttlefish.'),
(38351, 'Inkhorn', 'n.', 'A small bottle of horn or other material formerly used for\n   holding ink; an inkstand; a portable case for writing materials.'),
(38352, 'Inkhorn', 'a.', 'Learned; pedantic; affected.'),
(38353, 'Inkiness', 'n.', 'The state or quality of being inky; blackness.'),
(38354, 'Inking', 'a.', 'Supplying or covering with ink.'),
(38355, 'Inkle', 'n.', 'A kind of tape or braid.'),
(38356, 'Inkle', 'v. t.', 'To guess.'),
(38357, 'Inkling', 'n.', 'A hint; an intimation.'),
(38358, 'Inknee', 'n.', 'Same as Knock-knee.'),
(38359, 'Inkneed', 'a.', 'See Knock-kneed.'),
(38360, 'Inknot', 'v. t.', 'To fasten or bind, as with a knot; to knot together.'),
(38361, 'Inkstand', 'n.', 'A small vessel for holding ink, to dip the pen into;\n   also, a device for holding ink and writing materials.'),
(38362, 'Inkstone', 'n.', 'A kind of stone containing native vitriol or subphate of\n   iron, used in making ink.'),
(38363, 'Inlaced', 'imp. & p. p.', 'of Inlace'),
(38364, 'Inlacing', 'p. pr. & vb. n.', 'of Inlace'),
(38365, 'Inlace', 'v. t.', 'To work in, as lace; to embellish with work resembling\n   lace; also, to lace or enlace.'),
(38366, 'Inlaid', 'p. p.', 'of Inlay.'),
(38367, 'Inland', 'a.', 'Within the land; more or less remote from the ocean or from\n   open water; interior; as, an inland town.'),
(38368, 'Inland', 'a.', 'Limited to the land, or to inland routes; within the\n   seashore boundary; not passing on, or over, the sea; as, inland\n   transportation, commerce, navigation, etc.'),
(38369, 'Inland', 'a.', 'Confined to a country or state; domestic; not foreing; as,\n   an inland bill of exchange. See Exchange.'),
(38370, 'Inland', 'n.', 'The interior part of a country.'),
(38371, 'Inland', 'adv.', 'Into, or towards, the interior, away from the coast.'),
(38372, 'Inlander', 'n.', 'One who lives in the interior of a country, or at a\n   distance from the sea.'),
(38373, 'Inlard', 'v. t.', 'See Inlard.'),
(38374, 'Inlaw', 'v. t.', 'To clear of outlawry or attainder; to place under the\n   protection of the law.'),
(38375, 'Inlaied', 'imp. & p. p.', 'of Inlay'),
(38376, 'Inlaying', 'p. pr. & vb. n.', 'of Inlay'),
(38377, 'Inlay', 'v. t.', 'To lay within; hence, to insert, as pieces of pearl,\n   iviry, choice woods, or the like, in a groundwork of some other\n   material; to form an ornamental surface; to diversify or adorn with\n   insertions.'),
(38378, 'Inlay', 'n.', 'Matter or pieces of wood, ivory, etc., inlaid, or prepared\n   for inlaying; that which is inserted or inlaid for ornament or variety.'),
(38379, 'Inlayer', 'n.', 'One who inlays, or whose occupation it is to inlay.'),
(38380, 'Inleague', 'v. t.', 'To ally, or form an alliance witgh; to unite; to\n   combine.'),
(38381, 'Inlet', 'n.', 'A passage by which an inclosed place may be entered; a place\n   of ingress; entrance.'),
(38382, 'Inlet', 'n.', 'A bay or recess,as in the shore of a sea, lake, or large\n   river; a narrow strip of water running into the land or between\n   islands.'),
(38383, 'Inlet', 'n.', 'That which is let in or inland; an inserted material.'),
(38384, 'Inlist', 'v. t.', 'See Enlist.'),
(38385, 'Inlive', 'v. t.', 'To animate.'),
(38386, 'Inlock', 'v. t.', 'To lock in, or inclose.'),
(38387, 'In loco', '', 'In the place; in the proper or natural place.'),
(38388, 'Inlumine', 'v. t.', 'See Illumine.'),
(38389, 'Inmacy', 'n.', 'The state of being an inmate.'),
(38390, 'Inmate', 'n.', 'One who lives in the same house or apartment with another;\n   a fellow lodger; esp.,one of the occupants of an asylum, hospital, or\n   prison; by extension, one who occupies or lodges in any place or\n   dwelling.'),
(38391, 'Inmate', 'a.', 'Admitted as a dweller; resident; internal.'),
(38392, 'Inmeats', 'n.pl.', 'The edible viscera of animals, as the heart, liver,\n   etc.'),
(38393, 'Inmeshed', 'imp. & p. p.', 'of Inmesh'),
(38394, 'Inmesh', 'v. t.', 'To bring within meshes, as of a net; to enmesh.'),
(38395, 'Inmew', 'v. t.', 'To inclose, as in a mew or cage.'),
(38396, 'Inmost', 'a.', 'Deepest within; farthest from the surface or external part;\n   innermost.'),
(38397, 'Inned', 'imp. & p. p.', 'of Inn'),
(38398, 'Inning', 'p. pr. & vb. n.', 'of Inn'),
(38399, 'Innate', 'a.', 'Inborn; native; natural; as, innate vigor; innate\n   eloquence.'),
(38400, 'Innate', 'a.', 'Originating in, or derived from, the constitution of the\n   intellect, as opposed to acquired from experience; as, innate ideas.\n   See A priori, Intuitive.'),
(38401, 'Innate', 'a.', 'Joined by the base to the very tip of a filament; as, an\n   innate anther.'),
(38402, 'Innate', 'v. t.', 'To cause to exit; to call into being.'),
(38403, 'Innately', 'adv.', 'Naturally.'),
(38404, 'Innative', 'a.', 'Native.'),
(38405, 'Inner', 'a.', 'Further in; interior; internal; not outward; as, an spirit\n   or its phenomena.'),
(38406, 'Inner', 'a.', 'Not obvious or easily discovered; obscure.'),
(38407, 'Innerly', 'adv.', 'More within.'),
(38408, 'Innerved', 'imp. & p. p.', 'of Innerve'),
(38409, 'Innerve', 'v. t.', 'To give nervous energy or power to; to give increased\n   energy,force,or courage to; to invigorate; to stimulate.'),
(38410, 'Inning', 'n.', 'Ingathering; harvesting.'),
(38411, 'Inning', 'n.', 'The state or turn of being in; specifically, in cricket,\n   baseball, etc.,the turn or time of a player or of a side at the bat; --\n   often in the pl. Hence: The turn or time of a person, or a party, in\n   power; as, the Whigs went out, and the Democrats had their innings.'),
(38412, 'Inning', 'n.', 'Lands recovered from the sea.'),
(38413, 'Innixion', 'n.', 'Act of leaning upon something; incumbency.'),
(38414, 'Innocent', 'a.', 'Not harmful; free from that which can injure; innoxious;\n   innocuous; harmless; as, an innocent medicine or remedy.'),
(38415, 'Innocent', 'a.', 'Morally free from guilt; guiltless; not tainted with sin;\n   pure; upright.'),
(38416, 'Innocent', 'a.', 'Free from the guilt of a particular crime or offense; as,\n   a man is innocent of the crime charged.'),
(38417, 'Innocent', 'a.', 'Simple; artless; foolish.'),
(38418, 'Innocent', 'a.', 'Lawful; permitted; as, an innocent trade.'),
(38419, 'Innocent', 'a.', 'Not contraband; not subject to forfeiture; as, innocent\n   goods carried to a belligerent nation.'),
(38420, 'Innocent', 'n.', 'An innocent person; one free from, or unacquainted with,\n   guilt or sin.'),
(38421, 'Innocent', 'n.', 'An unsophisticated person; hence, a child; a simpleton;\n   an idiot.'),
(38422, 'Innodate', 'v. t.', 'To bind up,as in a knot; to include.'),
(38423, 'Innovate', 'v. t.', 'To bring in as new; to introduce as a novelty; as, to\n   innovate a word or an act.'),
(38424, 'Innovate', 'v. t.', 'To change or alter by introducing something new; to\n   remodel; to revolutionize.'),
(38425, 'Innovate', 'v. i.', 'To introduce novelties or changes; -- sometimes with\n   in or on.'),
(38426, 'Innuendo', 'n.', 'An oblique hint; a remote allusion or reference, usually\n   derogatory to a person or thing not named; an insinuation.'),
(38427, 'Innuendo', 'n.', 'An averment employed in pleading, to point the\n   application of matter otherwise unintelligible; an interpretative\n   parenthesis thrown into quoted matter to explain an obscure word or\n   words; -- as, the plaintiff avers that the defendant said that he\n   (innuendo the plaintiff) was a thief.'),
(38428, 'Innuent', 'a.', 'Conveying a hint; significant.'),
(38429, 'Innuit', 'n.', 'An Eskimo.'),
(38430, 'Innyard', 'n.', 'The yard adjoining an inn.'),
(38431, 'Inocular', 'a.', 'Inserted in the corner of the eye; -- said of the antenn/\n   of certain insects.'),
(38432, 'Inodiate', 'v. t.', 'To make odious or hateful.'),
(38433, 'Inogen', 'n.', 'A complex nitrogenous substance, which, by Hermann\'s\n   hypothesis, is continually decomposed and reproduced in the muscles,\n   during their life.'),
(38434, 'Inosinic', 'a.', 'Pertaining to, or derived from, inosite; as, inosinic\n   acid.'),
(38435, 'Inosite', 'n.', 'A white crystalline substance with a sweet taste, found in\n   certain animal tissues and fluids, particularly in the muscles of the\n   heart and lungs, also in some plants, as in unripe pease, beans, potato\n   sprouts, etc. Called also phaseomannite.'),
(38436, 'In posse', '', 'In possibility; possible, although not yet in existence or\n   come to pass; -- contradistinguished from in esse.'),
(38437, 'Inquest', 'n.', 'Inquiry; quest; search.'),
(38438, 'Inquest', 'n.', 'Judicial inquiry; official examination, esp. before a\n   jury; as, a coroner\'s inquest in case of a sudden death.'),
(38439, 'Inquest', 'n.', 'A body of men assembled under authority of law to inquire\n   into any matterm civil or criminal, particularly any case of violent or\n   sudden death; a jury, particularly a coroner\'s jury. The grand jury is\n   sometimes called the grand inquest. See under Grand.'),
(38440, 'Inquest', 'n.', 'The finding of the jury upon such inquiry.'),
(38441, 'Inquiet', 'v. t.', 'To disquiet.'),
(38442, 'Inquired', 'imp. & p. p.', 'of Inquire'),
(38443, 'Inquire', 'v. i.', 'To ask a question; to seek for truth or information by\n   putting queries.'),
(38444, 'Inquire', 'v. i.', 'To seek to learn anything by recourse to the proper\n   means of knoledge; to make examination.'),
(38445, 'Inquire', 'v. t.', 'To ask about; to seek to know by asking; to make\n   examination or inquiry respecting.'),
(38446, 'Inquire', 'v. t.', 'To call or name.'),
(38447, 'Inquirer', 'n.', 'One who inquires or examines; questioner; investigator.'),
(38448, 'Inquiry', 'n.', 'The act of inquiring; a seeking for information by asking\n   questions; interrogation; a question or questioning.'),
(38449, 'Inquiry', 'n.', 'Search for truth, information, or knoledge; examination\n   into facts or principles; research; invextigation; as, physical\n   inquiries.'),
(38450, 'Inrailed', 'imp. & p. p.', 'of Inrail'),
(38451, 'Inrail', 'v. t.', 'To rail in; to inclose or surround, as with rails.'),
(38452, 'Inroad', 'n.', 'The entrance of an enemy into a country with purposes of\n   hostility; a sudden or desultory incursion or invasion; raid;\n   encroachment.'),
(38453, 'Inroaded', 'imp. & p. p.', 'of Inroad'),
(38454, 'Inroad', 'v. t.', 'To make an inroad into; to invade.'),
(38455, 'Inroll', 'v. t.', 'See Enroll.'),
(38456, 'Inrush', 'n.', 'A rush inwards; as, the inrush of the tide.'),
(38457, 'Inrush', 'v. i.', 'To rush in.'),
(38458, 'Insafety', 'n.', 'Insecurity; danger.'),
(38459, 'Insane', 'a.', 'Exhibiting unsoundness or disorded of mind; not sane; mad;\n   deranged in mind; delirious; distracted. See Insanity, 2.'),
(38460, 'Insane', 'a.', 'Used by, or appropriated to, insane persons; as, an insane\n   hospital.'),
(38461, 'Insane', 'a.', 'Causing insanity or madness.'),
(38462, 'Insane', 'a.', 'Characterized by insanity or the utmost folly; chimerical;\n   unpractical; as, an insane plan, attempt, etc.'),
(38463, 'Insanely', 'adv.', 'Without reason; madly; foolishly.'),
(38464, 'Insanie', 'n.', 'Insanity.'),
(38465, 'Insanity', 'n.', 'The state of being insane; unsoundness or derangement of\n   mind; madness; lunacy.'),
(38466, 'Insanity', 'n.', 'Such a mental condition, as, either from the existence of\n   delusions, or from incapacity to distinguish between right and wrong,\n   with regard to any matter under action, does away with individual\n   responsibility.'),
(38467, 'Insapory', 'a.', 'Tasteless; unsavory.'),
(38468, 'Inscient', 'a.', 'Having little or no knowledge; ignorant; stupid; silly.'),
(38469, 'Inscient', 'a.', 'Having knowledge or insight; intelligent.'),
(38470, 'Insconce', 'v. t.', 'See Ensconce.'),
(38471, 'Inscribe', 'v. t.', 'To write or engrave; to mark down as something to be\n   read; to imprint.'),
(38472, 'Inscribe', 'v. t.', 'To mark with letters, charakters, or words.'),
(38473, 'Inscribe', 'v. t.', 'To assign or address to; to commend to by a shot\n   address; to dedicate informally; as, to inscribe an ode to a friend.'),
(38474, 'Inscribe', 'v. t.', 'To imprint deeply; to impress; to stamp; as, to\n   inscribe a sentence on the memory.'),
(38475, 'Inscribe', 'v. t.', 'To draw within so as to meet yet not cut the\n   boundaries.'),
(38476, 'Inscroll', 'v. t.', 'To write on a scroll; to record.'),
(38477, 'Insculp', 'v. t.', 'To engrave; to carve; to sculpture.'),
(38478, 'Inseamed', 'imp. & p. p.', 'of Inseam'),
(38479, 'Inseam', 'v. t.', 'To impress or mark with a seam or cicatrix.'),
(38480, 'Insearch', 'v. t.', 'To make search after; to investigate or examine; to\n   ensearch.'),
(38481, 'Insect', 'n.', 'One of the Insecta; esp., one of the Hexapoda. See Insecta.'),
(38482, 'Insect', 'n.', 'Any air-breathing arthropod, as a spider or scorpion.'),
(38483, 'Insect', 'n.', 'Any small crustacean. In a wider sense, the word is often\n   loosely applied to various small invertebrates.'),
(38484, 'Insect', 'n.', 'Fig.: Any small, trivial, or contemptible person or thing.'),
(38485, 'Insect', 'a.', 'Of or pertaining to an insect or insects.'),
(38486, 'Insect', 'a.', 'Like an insect; small; mean; ephemeral.'),
(38487, 'Insecta', 'n. pl.', 'One of the classes of Arthropoda, including those that\n   have one pair of antennae, three pairs of mouth organs, and breathe air\n   by means of tracheae, opening by spiracles along the sides of the body.\n   In this sense it includes the Hexapoda, or six-legged insects and the\n   Myriapoda, with numerous legs. See Insect, n.'),
(38488, 'Insecta', 'n.', 'In a more restricted sense, the Hexapoda alone. See\n   Hexapoda.'),
(38489, 'Insecta', 'n.', 'In the most general sense, the Hexapoda, Myriapoda, and\n   Arachnoidea, combined.'),
(38490, 'Insected', 'a.', 'Pertaining to, having the nature of, or resembling, an\n   insect.'),
(38491, 'Insecure', 'a.', 'Not secure; not confident of safety or permanence;\n   distrustful; suspicious; apprehensive of danger or loss.'),
(38492, 'Insecure', 'a.', 'Not effectually guarded, protected, or sustained; unsafe;\n   unstable; exposed to danger or loss.'),
(38493, 'Insense', 'v. t.', 'To make to understand; to instruct.'),
(38494, 'Inserted', 'imp. & p. p.', 'of Insert'),
(38495, 'Insert', 'v. t.', 'To set within something; to put or thrust in; to\n   introduce; to cause to enter, or be included, or contained; as, to\n   insert a scion in a stock; to insert a letter, word, or passage in a\n   composition; to insert an advertisement in a newspaper.'),
(38496, 'Inserted', 'a.', 'Situated upon, attached to, or growing out of, some part;\n   -- said especially of the parts of the flower; as, the calyx, corolla,\n   and stamens of many flowers are inserted upon the receptacle.'),
(38497, 'Inserve', 'v. i.', 'To be of use to an end; to serve.'),
(38498, 'Insessor', 'n.', 'One of the Insessores. The group includes most of the\n   common singing birds.'),
(38499, 'Inset', 'v. t.', 'To infix.'),
(38500, 'Inset', 'n.', 'That which is inserted or set in; an insertion.'),
(38501, 'Inset', 'n.', 'One or more separate leaves inserted in a volume before\n   binding; as: (a) A portion of the printed sheet in certain sizes of\n   books which is cut off before folding, and set into the middle of the\n   folded sheet to complete the succession of paging; -- also called\n   offcut. (b) A page or pages of advertisements inserted.'),
(38502, 'Inshaded', 'a.', 'Marked with different shades.'),
(38503, 'Inshave', 'n.', 'A plane for shaving or dressing the concave or inside\n   faces of barrel staves.'),
(38504, 'Inshell', 'v. t.', 'To hide in a shell.'),
(38505, 'Inship', 'v. t.', 'To embark.'),
(38506, 'Inshore', 'a.', 'Being near or moving towards the shore; as, inshore\n   fisheries; inshore currents.'),
(38507, 'Inshore', 'adv.', 'Towards the shore; as, the boat was headed inshore.'),
(38508, 'Inshrine', 'v. t.', 'See Enshrine.'),
(38509, 'Inside', 'adv.', 'Within the sides of; in the interior; contained within;\n   as, inside a house, book, bottle, etc.'),
(38510, 'Inside', 'a.', 'Being within; included or inclosed in anything; contained;\n   interior; internal; as, the inside passengers of a stagecoach; inside\n   decoration.'),
(38511, 'Inside', 'a.', 'Adapted to the interior.'),
(38512, 'Inside', 'n.', 'The part within; interior or internal portion; content.'),
(38513, 'Inside', 'n.', 'The inward parts; entrails; bowels; hence, that which is\n   within; private thoughts and feelings.'),
(38514, 'Inside', 'n.', 'An inside passenger of a coach or carriage, as\n   distinguished from one upon the outside.'),
(38515, 'Insight', 'n.', 'A sight or view of the interior of anything; a deep\n   inspection or view; introspection; -- frequently used with into.'),
(38516, 'Insight', 'n.', 'Power of acute observation and deduction; penetration;\n   discernment; perception.'),
(38517, 'Insignia', 'n. pl.', 'Distinguishing marks of authority, office, or honor;\n   badges; tokens; decorations; as, the insignia of royalty or of an\n   order.'),
(38518, 'Insignia', 'n. pl.', 'Typical and characteristic marks or signs, by which\n   anything is known or distinguished; as, the insignia of a trade.'),
(38519, 'Insinew', 'v. t.', 'To strengthen, as with sinews; to invigorate.'),
(38520, 'Insipid', 'a.', 'Wanting in the qualities which affect the organs of taste;\n   without taste or savor; vapid; tasteless; as, insipid drink or food.'),
(38521, 'Insipid', 'a.', 'Wanting in spirit, life, or animation; uninteresting;\n   weak; vapid; flat; dull; heavy; as, an insipid woman; an insipid\n   composition.'),
(38522, 'Insisted', 'imp. & p. p.', 'of Insist'),
(38523, 'Insist', 'v. i.', 'To stand or rest; to find support; -- with in, on, or\n   upon.'),
(38524, 'Insist', 'v. i.', 'To take a stand and refuse to give way; to hold to\n   something firmly or determinedly; to be persistent, urgent, or\n   pressing; to persist in demanding; -- followed by on, upon, or that;\n   as, he insisted on these conditions; he insisted on going at once; he\n   insists that he must have money.'),
(38525, 'Insition', 'n.', 'The insertion of a scion in a stock; ingraftment.'),
(38526, 'In situ', '', 'In its natural position or place; -- said of a rock or\n   fossil, when found in the situation in which it was originally formed\n   or deposited.'),
(38527, 'Insnared', 'imp. & p. p.', 'of Insnare'),
(38528, 'Insnare', 'v. t.', 'To catch in a snare; to entrap; to take by artificial\n   means.'),
(38529, 'Insnare', 'v. t.', 'To take by wiles, stratagem, or deceit; to involve in\n   difficulties or perplexities; to seduce by artifice; to inveigle; to\n   allure; to entangle.'),
(38530, 'Insnarer', 'n.', 'One who insnares.'),
(38531, 'Insnarl', 'v. t.', 'To make into a snarl or knot; to entangle; to snarl.'),
(38532, 'Insolate', 'v. t.', 'To dry in, or to expose to, the sun\'s rays; to ripen\n   or prepare by such exposure.'),
(38533, 'Insole', 'n.', 'The inside sole of a boot or shoe; also, a loose, thin\n   strip of leather, felt, etc., placed inside the shoe for warmth or\n   ease.'),
(38534, 'Insolent', 'a.', 'Deviating from that which is customary; novel; strange;\n   unusual.'),
(38535, 'Insolent', 'a.', 'Haughty and contemptuous or brutal in behavior or\n   language; overbearing; domineering; grossly rude or disrespectful;\n   saucy; as, an insolent master; an insolent servant.'),
(38536, 'Insolent', 'a.', 'Proceeding from or characterized by insolence; insulting;\n   as, insolent words or behavior.'),
(38537, 'Insomnia', 'n.', 'Want of sleep; inability to sleep; wakefulness;\n   sleeplessness.'),
(38538, 'Insomuch', 'adv.', 'So; to such a degree; in such wise; -- followed by that\n   or as, and formerly sometimes by both. Cf. Inasmuch.'),
(38539, 'Insooth', 'adv.', 'In sooth; truly.'),
(38540, 'Insoul', 'v. t.', 'To set a soul in; reflexively, to fix one\'s strongest\n   affections on.'),
(38541, 'Inspan', 'v. t. & i.', 'To yoke or harness, as oxen to a vehicle.'),
(38542, 'Inspect', 'v. t.', 'To look upon; to view closely and critically, esp. in\n   order to ascertain quality or condition, to detect errors, etc., to\n   examine; to scrutinize; to investigate; as, to inspect conduct.'),
(38543, 'Inspect', 'v. t.', 'To view and examine officially, as troops, arms, goods\n   offered, work done for the public, etc.; to oversee; to superintend.'),
(38544, 'Inspect', 'v. t.', 'Inspection.'),
(38545, 'Insperse', 'v. t.', 'To sprinkle; to scatter.'),
(38546, 'Insphere', 'v. t.', 'To place in, or as in, an orb a sphere. Cf. Ensphere.'),
(38547, 'Inspire', 'v. t.', 'To breathe into; to fill with the breath; to animate.'),
(38548, 'Inspire', 'v. t.', 'To infuse by breathing, or as if by breathing.'),
(38549, 'Inspire', 'v. t.', 'To draw in by the operation of breathing; to inhale; --\n   opposed to expire.'),
(38550, 'Inspire', 'v. t.', 'To infuse into the mind; to communicate to the spirit;\n   to convey, as by a divine or supernatural influence; to disclose\n   preternaturally; to produce in, as by inspiration.'),
(38551, 'Inspire', 'v. t.', 'To infuse into; to affect, as with a superior or\n   supernatural influence; to fill with what animates, enlivens, or\n   exalts; to communicate inspiration to; as, to inspire a child with\n   sentiments of virtue.'),
(38552, 'Inspired', 'imp. & p. p.', 'of Inspire'),
(38553, 'Inspire', 'v. i.', 'To draw in breath; to inhale air into the lungs; --\n   opposed to expire.'),
(38554, 'Inspire', 'v. i.', 'To breathe; to blow gently.'),
(38555, 'Inspired', 'a.', 'Breathed in; inhaled.'),
(38556, 'Inspired', 'a.', 'Moved or animated by, or as by, a supernatural influence;\n   affected by divine inspiration; as, the inspired prophets; the inspired\n   writers.'),
(38557, 'Inspired', 'a.', 'Communicated or given as by supernatural or divine\n   inspiration; having divine authority; hence, sacred, holy; -- opposed\n   to uninspired, profane, or secular; as, the inspired writings, that is,\n   the Scriptures.'),
(38558, 'Inspirer', 'n.', 'One who, or that which, inspirer.'),
(38559, 'Inspirit', 'v. t.', 'To infuse new life or spirit into; to animate; to\n   encourage; to invigorate.'),
(38560, 'Instable', 'a.', 'Not stable; not standing fast or firm; unstable; prone to\n   change or recede from a purpose; mutable; inconstant.'),
(38561, 'Install', 'v. t.', 'To set in a seat; to give a place to; establish (one)\n   in a place.'),
(38562, 'Install', 'v. t.', 'To place in an office, rank, or order; to invest with\n   any charge by the usual ceremonies; to instate; to induct; as, to\n   install an ordained minister as pastor of a church; to install a\n   college president.'),
(38563, 'Instamp', 'v. t.', 'See Enstamp.'),
(38564, 'Instance', 'n.', 'The act or quality of being instant or pressing; urgency;\n   solicitation; application; suggestion; motion.'),
(38565, 'Instance', 'n.', 'That which is instant or urgent; motive.'),
(38566, 'Instance', 'n.', 'Occasion; order of occurrence.'),
(38567, 'Instance', 'n.', 'That which offers itself or is offered as an illustrative\n   case; something cited in proof or exemplification; a case occurring; an\n   example.'),
(38568, 'Instance', 'n.', 'A token; a sign; a symptom or indication.'),
(38569, 'Instance', 'v. t.', 'To mention as a case or example; to refer to; to cite;\n   as, to instance a fact.'),
(38570, 'Instance', 'v. i.', 'To give an example.'),
(38571, 'Instancy', 'n.', 'Instance; urgency.'),
(38572, 'Instant', 'a.', 'Pressing; urgent; importunate; earnest.'),
(38573, 'Instant', 'a.', 'Closely pressing or impending in respect to time; not\n   deferred; immediate; without delay.'),
(38574, 'Instant', 'a.', 'Present; current.'),
(38575, 'Instant', 'adv.', 'Instantly.'),
(38576, 'Instant', 'a.', 'A point in duration; a moment; a portion of time too short\n   to be estimated; also, any particular moment.'),
(38577, 'Instant', 'a.', 'A day of the present or current month; as, the sixth\n   instant; -- an elliptical expression equivalent to the sixth of the\n   month instant, i. e., the current month. See Instant, a., 3.'),
(38578, 'Instar', 'v. t.', 'To stud as with stars.'),
(38579, 'Instated', 'imp. & p. p.', 'of Instate'),
(38580, 'Instate', 'v. t.', 'To set, place, or establish, as in a rank, office, or\n   condition; to install; to invest; as, to instate a person in greatness\n   or in favor.'),
(38581, 'Instaure', 'v. t.', 'To renew or renovate; to instaurate.'),
(38582, 'Instead', 'adv.', 'In the place or room; -- usually followed by of.'),
(38583, 'Instead', 'adv.', 'Equivalent; equal to; -- usually with of.'),
(38584, 'Insteep', 'v. t.', 'To steep or soak; to drench.'),
(38585, 'Instep', 'n.', 'The arched middle portion of the human foot next in front\n   of the ankle joint.'),
(38586, 'Instep', 'n.', 'That part of the hind leg of the horse and allied animals,\n   between the hock, or ham, and the pastern joint.'),
(38587, 'Instill', 'v. t.', 'To drop in; to pour in drop by drop; hence, to impart\n   gradually; to infuse slowly; to cause to be imbibed.'),
(38588, 'Instinct', 'a.', 'Urged or stimulated from within; naturally moved or\n   impelled; imbued; animated; alive; quick; as, birds instinct with life.'),
(38589, 'Instinct', 'a.', 'Natural inward impulse; unconscious, involuntary, or\n   unreasoning prompting to any mode of action, whether bodily, or mental,\n   without a distinct apprehension of the end or object to be\n   accomplished.'),
(38590, 'Instinct', 'a.', 'Specif., the natural, unreasoning, impulse by which an\n   animal is guided to the performance of any action, without of\n   improvement in the method.'),
(38591, 'Instinct', 'a.', 'A natural aptitude or knack; a predilection; as, an\n   instinct for order; to be modest by instinct.'),
(38592, 'Instinct', 'v. t.', 'To impress, as an animating power, or instinct.'),
(38593, 'Instop', 'v. t.', 'To stop; to close; to make fast; as, to instop the\n   seams.'),
(38594, 'Instore', 'v. t.', 'To store up; to inclose; to contain.'),
(38595, 'Instruct', 'a.', 'Arranged; furnished; provided.'),
(38596, 'Instruct', 'a.', 'Instructed; taught; enlightened.'),
(38597, 'Instruct', 'v. t.', 'To put in order; to form; to prepare.'),
(38598, 'Instruct', 'v. t.', 'To form by communication of knowledge; to inform the\n   mind of; to impart knowledge or information to; to enlighten; to teach;\n   to discipline.'),
(38599, 'Instruct', 'v. t.', 'To furnish with directions; to advise; to direct; to\n   command; as, the judge instructs the jury.'),
(38600, 'Instyle', 'v. t.', 'To style.'),
(38601, 'Insue', 'v. i.', 'See Ensue, v. i.'),
(38602, 'Insular', 'a.', 'Of or pertaining to an island; of the nature, or\n   possessing the characteristics, of an island; as, an insular climate,\n   fauna, etc.'),
(38603, 'Insular', 'a.', 'Of or pertaining to the people of an island; narrow;\n   circumscribed; illiberal; contracted; as, insular habits, opinions, or\n   prejudices.'),
